INSERT INTO `course` VALUES ('1', 'Khóa Học 1', '<p>Trong b&agrave;i ph&aacute;t biểu trước thềm trận đấu với Anderlecht, HLV Mourinho tỏ ra căng thẳng khi n&oacute;i về Martial. Chiến lược gia người Bồ Đ&agrave;o Nha giải th&iacute;ch nguy&ecirc;n nh&acirc;n loại bỏ tiền đạo 36 triệu bảng thời gian qua ho&agrave;n to&agrave;n v&igrave; l&yacute; do chuy&ecirc;n m&ocirc;n.</p>\r\n\r\n<p>&quot;Ch&uacute;ng t&ocirc;i đ&atilde; c&oacute; 10 th&aacute;ng l&agrave;m việc c&ugrave;ng nhau nhưng t&ocirc;i kh&ocirc;ng nhận thấy những tiến triển từ Martial. Cậu ấy muốn ra s&acirc;n th&igrave; cần phải cho t&ocirc;i nh&igrave;n thấy những điều t&ocirc;i mong muốn. Tại MU, mọi cơ hội đều rộng mở.&nbsp;</p>\r\n\r\n<p>&quot;Rashford l&agrave; trường hợp tương tự Martial nhưng t&ocirc;i đang d&ugrave;ng cậu ấy kh&aacute; nhiều. C&oacute; thể Marcus kh&ocirc;ng ghi b&agrave;n nhưng t&ocirc;i lu&ocirc;n thấy được tinh thần tiến về ph&iacute;a trước. Đ&oacute; l&agrave; tố chất bắt buộc của một cầu thủ MU&quot;, HLV Mourinho cho biết.</p>\r\n', '6', null, '2', '15000', '2017-05-22', null, null, '1', '1', '1', '1', '0', '1', '0', '2017-04-21 00:27:40', '2017-04-21 00:27:40', '6', '6');
INSERT INTO `course` VALUES ('2', 'Khóa Học 2', '<p>Trong b&agrave;i ph&aacute;t biểu trước thềm trận đấu với Anderlecht, HLV Mourinho tỏ ra căng thẳng khi n&oacute;i về Martial. Chiến lược gia người Bồ Đ&agrave;o Nha giải th&iacute;ch nguy&ecirc;n nh&acirc;n loại bỏ tiền đạo 36 triệu bảng thời gian qua ho&agrave;n to&agrave;n v&igrave; l&yacute; do chuy&ecirc;n m&ocirc;n.</p>\r\n\r\n<p>&quot;Ch&uacute;ng t&ocirc;i đ&atilde; c&oacute; 10 th&aacute;ng l&agrave;m việc c&ugrave;ng nhau nhưng t&ocirc;i kh&ocirc;ng nhận thấy những tiến triển từ Martial. Cậu ấy muốn ra s&acirc;n th&igrave; cần phải cho t&ocirc;i nh&igrave;n thấy những điều t&ocirc;i mong muốn. Tại MU, mọi cơ hội đều rộng mở.&nbsp;</p>\r\n\r\n<p>&quot;Rashford l&agrave; trường hợp tương tự Martial nhưng t&ocirc;i đang d&ugrave;ng cậu ấy kh&aacute; nhiều. C&oacute; thể Marcus kh&ocirc;ng ghi b&agrave;n nhưng t&ocirc;i lu&ocirc;n thấy được tinh thần tiến về ph&iacute;a trước. Đ&oacute; l&agrave; tố chất bắt buộc của một cầu thủ MU&quot;, HLV Mourinho cho biết.</p>\r\n', '6', null, '1', '0', '2017-05-30', '0000-00-00', '0000-00-00', '1', '12', '1', '1', '0', '1', '0', '2017-04-21 00:27:40', '2017-04-21 00:27:40', '6', '6');
INSERT INTO `course_news` VALUES ('1', '4', 'Autem laboriosam officiis autem repudiandae nisi molestias qui.', 'Possimus numquam delectus aliquam quo accusantium eaque deserunt molestias doloremque totam ducimus porro qui aut natus rerum qui laudantium fuga nemo iusto sapiente maiores doloremque quisquam assumenda mollitia et eveniet omnis rem debitis sit voluptatem necessitatibus recusandae eaque porro iure ut velit est ea consequatur dolores dolor doloribus voluptatem sit rem qui facere sit non dolor pariatur molestias ipsum amet quos et excepturi nostrum et ea id quis accusamus repellat repudiandae consequuntur accusamus in fuga quo iure maxime dicta qui non quibusdam quibusdam quidem occaecati adipisci sit veritatis facere labore quidem fuga dolore quibusdam officia veritatis delectus eligendi qui ut sed molestias sit voluptate aut earum aliquid aliquam quam et vitae consequatur ratione ab et earum minima dicta ad hic quia adipisci et ratione quia quidem non minus perspiciatis ut magni id voluptatum sed voluptatibus suscipit impedit laborum magnam aspernatur fugit eum libero praesentium architecto in vero fugit provident ullam sapiente rerum rerum quis reprehenderit quia rerum aut debitis delectus eius deleniti rem voluptates explicabo aut hic placeat adipisci quo voluptatem autem ducimus et ipsam natus voluptates aut possimus aspernatur quia sit harum ut qui est cupiditate ratione nihil beatae magni qui eveniet accusamus iusto similique voluptas pariatur distinctio molestias iusto eligendi consectetur quasi fugiat et aut excepturi doloremque cupiditate aperiam consequatur fuga est hic possimus dignissimos qui nisi aut est ut quasi iste eos assumenda sed qui dolores debitis ullam aspernatur rerum modi sint voluptas magni consectetur voluptatem aut fugiat voluptatem modi dolor amet sed est minima maxime fugiat quae cumque ut molestias sed numquam doloremque ut nihil quam dolorem aperiam et voluptas ab tempora tempora odit est est doloremque molestias reprehenderit eum itaque nesciunt praesentium voluptatem necessitatibus ex odit voluptatem sit et veniam quos qui numquam iure expedita temporibus quidem illum consectetur voluptate qui delectus perspiciatis nam aut optio sunt voluptate vitae ea omnis quos et quia in dolor sed explicabo commodi odio ipsum alias hic fugit ad ea velit voluptates enim sapiente nobis eaque vero maxime quia est quibusdam similique id laboriosam accusamus optio sequi nulla cum reprehenderit sapiente ratione libero commodi sapiente hic harum repellendus eum qui autem deleniti ratione hic labore esse exercitationem ipsam esse est rerum cum recusandae recusandae id aperiam voluptates nulla et incidunt praesentium amet ab rerum consequuntur enim deserunt quidem maxime perferendis ut aut cum at sequi veritatis similique perferendis temporibus distinctio pariatur iste sed.', '0', '2017-05-02 22:58:41', '2017-05-02 22:58:41');
