INSERT INTO `course_news` VALUES ('9', '7', 'Sit qui provident sint placeat.', 'Eum labore rem delectus voluptates esse aut provident quidem quia enim modi repudiandae repudiandae enim suscipit magnam pariatur hic explicabo ea id quas et et deleniti quia mollitia ad nobis et sed repellendus sunt sequi ullam eius non pariatur itaque sed nihil rerum quia nesciunt fugit excepturi et blanditiis ut est officia omnis vel molestiae aut sint inventore nostrum veniam error tenetur qui esse aut sunt necessitatibus laboriosam autem qui in suscipit nobis neque et aut ut ut debitis dolor et voluptatem facere est neque quam optio provident vel dolorum ipsam est incidunt nisi non provident beatae fugit iure iste aut nam illum et unde provident beatae quia et et eum error corrupti tempora nulla totam sint unde numquam assumenda porro voluptatem et officiis nisi beatae iste omnis adipisci doloremque cupiditate consectetur repellendus ipsam fuga non non repellendus labore odit magni voluptas voluptas dolor sed exercitationem hic nesciunt error quos porro sed est fugiat fugit eos doloribus dolorum numquam labore dolores aut aut beatae veritatis necessitatibus inventore provident voluptas blanditiis voluptas quia illum explicabo consectetur perferendis quis ut est aut vel aperiam corrupti unde quam magnam possimus voluptatibus quia mollitia iste accusantium et ipsa exercitationem repellendus rem officiis neque enim nemo consequatur expedita consequatur voluptatem molestiae quia impedit aspernatur sed nam ea in nihil occaecati est ut perspiciatis suscipit voluptates explicabo et nihil quod quos voluptatem voluptatibus ut consequatur distinctio non dolorem excepturi blanditiis inventore illo quia qui maiores et sunt consectetur sit consequatur distinctio molestias debitis enim eius enim et suscipit adipisci optio sed nostrum odio molestiae temporibus nihil id voluptatum eligendi aliquam nulla perspiciatis quis totam doloribus nam necessitatibus dolor perspiciatis tenetur sed architecto q