INSERT INTO `course_news` VALUES ('11', '4', 'Libero tenetur molestiae sed quaerat explicabo aliquam.', 'Blanditiis sint sunt aut suscipit et veritatis in sed praesentium qui architecto a rem eum quam reprehenderit quia nam molestias quis omnis adipisci sint nisi nihil eligendi quia voluptatem et laboriosam non totam omnis quibusdam et aperiam sunt odio dolores provident quam sed debitis voluptatum corporis dolores voluptatem itaque itaque repudiandae et incidunt ut sit ut beatae quia sed odit et voluptatem dolorum placeat quia sed ullam autem qui rerum quod harum odio eveniet et aliquam adipisci unde dicta dolorem omnis voluptatem porro voluptas neque sunt dolorum repellat ex rem facilis repellat sed veniam aspernatur sint accusantium sunt voluptatem sint dolorum consequatur omnis nam laboriosam earum nostrum autem ea consequuntur eos ex voluptas inventore fugiat cupiditate veritatis quos suscipit eum harum laudantium est dolor eum dolorum consequatur soluta ea pariatur ut et nobis praesentium ea natus illo officiis debitis et ratione asperiores quae fugit maxime voluptatem aliquam consequatur maiores eaque incidunt odio rem voluptates possimus corrupti aliquid illum non cupiditate totam deserunt ipsam delectus ad consectetur alias unde ea facere facere asperiores aut neque dolor blanditiis repellat voluptas consequuntur dolor quo rem eaque est optio nobis ea soluta quisquam praesentium est molestiae ad nulla ut itaque sit accusamus quidem ut qui dolor qui atque veniam dolor a quis repellat error sit ipsam dicta suscipit molestias iste qui delectus dolorem eveniet doloremque quibusdam dolor molestiae nostrum voluptates odit corporis nihil enim aut quasi occaecati enim fugit repellendus omnis rerum id totam ipsam laborum iusto eum soluta eius exercitationem saepe blanditiis velit totam qui blanditiis ab molestias labore asperiores est atque pariatur temporibus modi dignissimos sunt enim non eum quos.', '0', '2017-05-02 22:58:42', '2017-05-02 22:58:42');
