INSERT INTO `course_news` VALUES ('13', '9', 'Iure autem eligendi sint nihil temporibus mollitia sapiente.', 'Fugit aut sunt quae dolorem ipsum maxime culpa nemo eius sit rerum qui ipsa occaecati temporibus vitae similique et in rerum ipsum commodi animi sequi cumque voluptatem totam voluptates quia praesentium magni soluta expedita reprehenderit repudiandae dolores voluptatem nihil et reprehenderit quam provident nemo similique omnis pariatur nihil atque ut qui ipsa quaerat laboriosam et deleniti numquam quia laudantium et consequatur sint est voluptatem earum non id dolores eum animi omnis consequatur explicabo excepturi illum veritatis soluta est nemo asperiores sapiente et sed rerum aspernatur animi repellat deserunt dolorum impedit molestiae exercitationem pariatur harum qui ullam maxime nobis non dolor iste nobis molestiae temporibus et autem minus sit accusamus quidem blanditiis laudantium quo nihil soluta nihil veniam repellendus eum iste optio necessitatibus aut est quam sit quia quia debitis consequatur incidunt debitis laudantium est qui aut non repellat quia consectetur eius ut cumque magni sint qui quis amet aut quaerat dolor aliquam et molestiae iusto consequuntur illo quibusdam rerum velit est eius libero quaerat error quis eaque autem quo veritatis est quisquam ea quos aut delectus dolores odit sequi quos itaque voluptatibus quisquam id error impedit et qui dolor ratione animi dolor quae aut incidunt et velit soluta et ea quisquam voluptatum cumque repellendus ratione ab porro laboriosam nisi alias sit doloribus provident dicta sapiente iure adipisci ad iste ut ut quasi vel et omnis nihil amet accusantium neque temporibus eum atque dolorem dolores doloribus sunt et qui eum et aut consequuntur non similique esse consequuntur autem atque sit consequatur quam vel incidunt unde ducimus sit dolorum esse itaque accusamus velit consectetur nemo non id nihil dolores consectetur consequatur quam quidem quas repellat rerum rerum non ullam occaecati qui qui nos