INSERT INTO `course_news` VALUES ('14', '7', 'Veniam esse quas recusandae exercitationem voluptates commodi harum.', 'Nisi sunt iusto velit possimus enim dolore iure ad iure ut quis corporis soluta eos aut sit aliquid excepturi quos minus consequuntur inventore quisquam error commodi vel nisi fugiat in ex eveniet et recusandae cumque asperiores delectus vero laboriosam consequuntur minima maxime ut praesentium rerum ipsum optio temporibus dicta dolore corporis at quas quia est provident id architecto modi dicta atque quos neque est quam voluptate quo iste et qui eius inventore omnis adipisci sapiente consequatur sint est exercitationem quos quia adipisci nihil exercitationem eum vel explicabo saepe nulla voluptatem quas est vel tenetur et vero pariatur aut veniam consequatur laborum minus in cupiditate architecto doloremque tempora occaecati qui iusto eius ut in eos cum ducimus sunt nihil quos iste neque et necessitatibus eaque dignissimos et unde suscipit eius culpa rerum nihil aliquid qui distinctio repudiandae ipsa quo autem delectus mollitia qui sunt et eius architecto aut dignissimos perferendis commodi reiciendis et aut iste quo ad nihil minima quibusdam qui culpa odio ipsam nihil atque saepe minima vel fugiat eos voluptatibus in magnam earum eum reprehenderit at eligendi impedit et inventore praesentium assumenda aperiam aut ut adipisci ea quaerat quo qui culpa et ducimus similique voluptatum unde repudiandae quod quia sed assumenda quis quam magnam illum aliquid est recusandae delectus qui nihil adipisci voluptatem in nisi eius quaerat cumque ea aspernatur debitis repellat qui quia voluptatem quia nemo dignissimos qui id rem quo ipsum voluptate dolorem nihil iste porro qui aliquid iste eos voluptatem aut ut qui et maiores magni veniam soluta fugiat possimus qui eos error qui et sed quo qui alias totam delectus eos facere tenetur voluptatibus id fugiat quam dolores ipsum nobis aspernatur ea et nam tempora et ut sunt reprehenderit qui ut sint et dolor et aut t