INSERT INTO `course_news` VALUES ('15', '10', 'Debitis sit nihil dolores amet vel.', 'Saepe facere voluptatem veritatis ut magni tempora esse reiciendis distinctio voluptate exercitationem numquam in odit exercitationem in inventore enim earum ratione sit laboriosam ex voluptatem architecto ut fugiat dolores similique consequatur sit itaque nihil rerum adipisci tempore molestias adipisci molestiae consequatur molestias repellat est molestiae optio eius dolores autem qui ullam a illum architecto minus ea recusandae ad corrupti voluptates voluptas exercitationem minima iusto soluta ut optio aliquid ipsum omnis quisquam vel quam tenetur et hic perferendis quod atque incidunt enim atque et velit vitae facilis vel quia quaerat voluptates molestiae necessitatibus aliquam debitis incidunt ex officia voluptate est nisi non tempora voluptas quia dolor animi sint ipsum non aut doloremque atque maxime molestiae optio dolor et nemo sit dolor assumenda soluta ad et ad provident similique et voluptas praesentium officiis et qui aut necessitatibus repellendus eaque dolore laboriosam ipsa dolores est ipsam reprehenderit corporis sint nulla aut quibusdam eaque aut rerum qui ullam sequi impedit maxime explicabo occaecati laboriosam et dignissimos sunt repellendus ratione qui facilis in et nihil laudantium occaecati tempora rem velit nobis omnis maiores et quisquam quaerat quia praesentium eligendi dignissimos cum dicta ut beatae quia aut nulla unde beatae sint ea possimus nulla ea et est molestiae praesentium officiis illo excepturi nisi occaecati non porro illum eius provident est dolore nesciunt officia laboriosam repudiandae qui sed sequi magni saepe neque et est id repellat id sequi ipsa accusamus dolor officia totam ut maiores laboriosam necessitatibus consequatur aut consequuntur ut corporis aut ea vel ipsa totam qui in sit harum dignissimos animi laboriosam quisquam sequi ipsam non deserunt neque voluptatem quidem blanditiis voluptatem laboriosam est aperiam et voluptatem aliq