INSERT INTO `course_news` VALUES ('16', '10', 'Sapiente est in quasi occaecati quo.', 'Earum illum qui sunt laudantium reprehenderit libero suscipit dignissimos unde cupiditate possimus neque eum omnis distinctio hic autem non rerum sint placeat repellendus autem et at labore explicabo eaque eum reprehenderit ipsam fugiat sed ut aut consequatur quae aut porro dignissimos eius ipsa deserunt doloremque accusantium voluptas velit et dolor totam omnis inventore iusto numquam quaerat vel est fuga corporis ut id illo molestias non cupiditate quia eligendi sapiente voluptatem tempora animi aspernatur et quia officia nesciunt quo officiis autem quod ut earum rerum deleniti non vel dolore saepe commodi a qui non amet eos qui eius excepturi ut qui est ut et repellendus rerum laboriosam vero architecto fugit veniam non tempore ut id repellendus enim debitis sit architecto quas qui et maiores minima ipsum neque quis voluptatem repellat saepe quae libero et dolore molestias dolor doloremque qui consectetur excepturi cupiditate ea impedit enim qui amet officiis et iure deserunt eligendi molestias et voluptas velit iure ducimus qui doloribus illo ratione voluptas vel qui illum minus molestias libero ipsum voluptatibus corrupti cupiditate amet tenetur esse in voluptatem rerum natus saepe impedit animi est ut aliquam qui ipsum modi ut ullam tempora nobis molestias fuga ipsum accusantium iste harum qui et quibusdam dolores dolores distinctio dolorem nulla ipsam nostrum dignissimos unde in officiis omnis sed commodi qui tempore dolorum sunt id dolores earum totam magni ipsam eos eum nostrum commodi odit rerum culpa error maiores officia eveniet magni porro maiores natus ex sit quia alias cumque delectus ut ea hic nostrum beatae dicta quis omnis voluptatem unde dolores tempore ut aut aspernatur fuga nulla vel vero alias iste tempore praesentium tenetur explicabo suscipit repudiandae laborum quis qui quia libero eos perspiciatis distinctio et quo quasi eum sint error tenetur doloremque 