INSERT INTO `course_news` VALUES ('17', '9', 'Ut quasi et aut earum eveniet quo est.', 'Vel molestias asperiores nisi facilis voluptatem dolorem voluptatum minima natus cum rerum et minima est quae sunt est facere architecto mollitia sint nam aut repellendus itaque optio dolorem minima corrupti fuga aperiam illum blanditiis dolor nulla delectus cumque et reprehenderit voluptas recusandae tenetur debitis aliquam nihil fugit numquam et est necessitatibus dolorem ipsa culpa nisi est soluta quo accusantium qui occaecati corrupti cumque vero vitae alias provident dolor reiciendis sit recusandae tempora incidunt ex harum eos sint earum eos ex eligendi unde et beatae eaque est facilis magnam magnam ipsam aut rerum quaerat saepe qui quia architecto et laboriosam vitae sint placeat alias officia quae at non aliquam tempora ut rerum odit quasi voluptatem unde et consequatur rerum doloribus quidem vel et sit molestiae corrupti eligendi amet qui qui suscipit ut sint vero id consectetur minus ratione eveniet illo ea consequatur et commodi sed non beatae nemo qui et veritatis suscipit possimus perferendis ut consequatur cupiditate inventore est incidunt sed doloribus consequatur ut quo labore voluptas aut tenetur libero dolores quia pariatur hic delectus sit libero non aut quibusdam voluptas impedit non ut voluptatem et fugiat totam nemo inventore quia ut nostrum quis dolores voluptas quidem velit ut possimus blanditiis et voluptate et alias commodi modi debitis illo omnis quia deleniti sunt quod quia eos totam est molestiae illo ea aut fuga placeat perferendis necessitatibus praesentium mollitia ut iusto nihil et eos maiores quisquam ut nobis sint quia et fuga exercitationem odit exercitationem hic incidunt at voluptates placeat rem ullam iure iure labore dignissimos quis voluptatem quidem sit placeat optio eligendi vero ut cum et et omnis qui inventore provident dolore et doloribus qui atque voluptas ratione itaque cupiditate ut sint dolore quod adipisci sit magni nihil a volup