INSERT INTO `course_news` VALUES ('18', '6', 'Corrupti facere sed ea fuga.', 'Quo deleniti amet deserunt quae exercitationem neque quidem mollitia ut eaque velit corrupti est magnam occaecati cupiditate qui aliquam at non commodi officia nesciunt corrupti iure dolorem ullam iusto distinctio numquam sint facere qui consequatur ut animi quam voluptatibus voluptatem non officiis quisquam delectus aliquam maiores sint assumenda molestiae praesentium et quos illum occaecati qui vero minus assumenda quia a cum iure rem dolor voluptatem veritatis laudantium iusto ab repudiandae eum molestiae sit cum atque voluptates asperiores voluptatem repudiandae inventore cupiditate odit delectus maxime harum expedita ut aut dolor nulla consequuntur a vitae quis nihil quaerat maiores omnis praesentium est suscipit vitae omnis earum at qui nisi et ipsam placeat eligendi velit voluptatem fuga tempore expedita aperiam quae repellat veniam ea facilis aspernatur ab molestiae labore distinctio ut laboriosam aliquid nam saepe aliquid unde eaque voluptatem minima rerum doloremque voluptatem quaerat cupiditate tenetur saepe a odit consequuntur laboriosam facere minus est omnis cumque facilis est et placeat fugit aperiam iure amet quam sed velit dolorem ratione et impedit eaque commodi voluptas recusandae nihil cum expedita nesciunt placeat sed commodi temporibus odio quaerat maiores ea sint quis necessitatibus est et aut dolorem voluptates hic sint deleniti et dolorem sed cupiditate unde quam sit suscipit ea qui quos ullam nisi molestiae voluptatem ut natus distinctio eum doloremque hic deserunt aut placeat facilis delectus perspiciatis ea dolorem qui nihil sint architecto perferendis voluptatum nostrum dolor vel minus eaque aliquid vero illum temporibus mollitia recusandae exercitationem doloribus sint et aut nulla ipsa totam sapiente est et quis.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('19', '3', 'Et ut sunt ullam quo quis.', 'Dolorem modi minus est est soluta eum suscipit amet dolores animi sit qui velit eligendi qui tempora deserunt error assumenda consectetur sit enim in quia accusantium qui et nostrum cumque expedita corrupti doloremque quisquam nulla sit nobis necessitatibus eveniet odio vitae inventore illo veniam porro debitis dignissimos aut vel dolore sit ipsam quos magnam nam odit quia et aut corporis provident consequatur ad aut est voluptatem dolorem qui autem omnis iusto iusto amet animi et quod ut minima quis omnis deleniti sint quisquam sed odio numquam dolor facilis distinctio non quia esse aut dolorum tempora dolorum qui ut iusto temporibus reprehenderit et quia quaerat dolor debitis perferendis aut dolorem dolorem autem quisquam esse ea quia autem repudiandae nostrum beatae repellat quisquam officiis ducimus et ex ut consequatur debitis at qui sint cumque et eos autem recusandae molestiae quisquam nulla eveniet ipsam cumque quis quod minus nulla eum quisquam voluptatem sunt mollitia quo accusamus commodi aut tempore non animi quia quae reiciendis voluptatibus cumque voluptas accusamus quos expedita reiciendis qui vitae harum non enim et praesentium ex recusandae nihil aut voluptatum voluptates nihil recusandae voluptate eum assumenda aut expedita quia illum quos explicabo tempore exercitationem quis enim error cumque eum nobis maiores a temporibus voluptas assumenda facilis quos possimus optio dolores enim explicabo ea tempora alias delectus autem aut quia mollitia quaerat aperiam qui aut facere libero iure nisi ea aliquam eum non perferendis iste accusamus dolor et vero dolore voluptatem ullam dolore animi beatae ipsam cum consequuntur est ut enim nesciunt fuga in dolores reiciendis quam dolor temporibus rem minima ut corrupti maiores fuga totam non officiis recusandae in occaecati dolores quo perferendis quisquam ipsum sit numquam beatae assumenda quisquam voluptatem et voluptatum dolores sint blanditiis assumenda corporis et est iste debitis sed ab eum similique accusantium quod veniam recusandae accusantium vel dignissimos aut quia molestiae aut qui provident debitis quas fugit velit repudiandae totam mollitia laborum et illum inventore modi asperiores rerum cumque ab voluptatibus in earum ducimus sunt tenetur laboriosam ducimus quisquam molestiae qui autem iure natus voluptas hic enim non rerum consequatur eius.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('20', '8', 'Illum qui unde dolorem.', 'Dolore placeat quas totam quia soluta culpa dolorem accusamus ut rerum est similique et fuga similique cupiditate fugit quod iusto iure blanditiis similique eos magni aut velit sit eos aliquid quas voluptatum velit hic laudantium dignissimos cum ipsam voluptatibus sunt amet nesciunt et rerum ut omnis temporibus cupiditate sequi molestiae impedit ad inventore dolor laboriosam autem laborum odit reiciendis consectetur distinctio alias dolor distinctio alias cum nulla vero doloribus animi provident asperiores iste doloremque enim consequatur dolorem libero perspiciatis magnam qui laboriosam fugiat voluptatem sequi a corporis perferendis omnis est quam doloribus assumenda qui sed quas consequatur et itaque adipisci voluptas ut amet eum omnis perspiciatis ea nemo autem quaerat enim voluptas reprehenderit quam sunt recusandae quia nihil mollitia et reiciendis et ut aut ut facilis repellendus fugiat illum mollitia perspiciatis consequatur placeat adipisci voluptate asperiores assumenda adipisci dolor id quo qui consequuntur ex est quis laudantium accusamus sint aperiam sequi non dolore dolorem dolor fugiat culpa ipsum reprehenderit molestiae est sint officia culpa enim autem vel totam dignissimos magnam in doloremque doloribus quod voluptatem in accusantium qui praesentium est possimus nihil totam fuga natus velit placeat error atque molestiae nesciunt exercitationem porro quia laborum ab sint voluptas porro et iusto ipsam modi velit vel corrupti laborum error molestias aut suscipit rem dolor expedita autem quos et velit qui occaecati molestiae est distinctio nihil fuga quas est voluptatem consequatur modi quis voluptas sunt labore eius ea rem odit sint minus voluptatem occaecati aliquam non suscipit voluptas aut veniam autem consequatur minus libero placeat quas non est reprehenderit dicta aut aspernatur accusamus magnam asperiores dolores occaecati dolorem perspiciatis quae iusto qui laudantium dolor nesciunt nihil expedita ut et optio asperiores est qui praesentium modi quo nobis cupiditate nihil id nesciunt quibusdam placeat exercitationem ut voluptatem et dolores distinctio quia sunt odit alias sapiente autem et numquam ut sunt est quos aspernatur voluptas temporibus beatae molestiae odit quo est aperiam molestiae voluptatibus accusantium dolores dolor molestiae magnam perferendis molestias deleniti omnis qui qui odio occaecati hic non sit aliquid porro cum doloribus quae ut veniam enim illo in cum omnis quidem vel distinctio placeat et consequatur nulla dolor aut explicabo optio et veritatis unde error in vel laudantium eius voluptatem dolores sapiente corporis repellendus totam illum sed sint voluptas quo tenetur et provident dolores velit aspernatur illum aut sequi ullam odit vel vel doloremque et commodi sit voluptatem voluptatem et reiciendis illo ipsum reiciendis qui repellendus esse beatae eos voluptatem ad expedita fugit culpa voluptate molestias ex molestiae sed et.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('21', '8', 'Corporis unde quia alias ut qui non voluptas quis.', 'Sunt qui voluptatum est esse at et nobis sed nihil ab rerum nisi omnis molestiae est quod voluptates repudiandae qui omnis eos esse reiciendis quas facere et est nulla consectetur et aperiam ea ratione ipsum fuga aut exercitationem occaecati fuga labore maiores quis expedita sequi eum atque qui iusto delectus enim nobis et quaerat repudiandae ut molestias suscipit et quia qui amet aliquam nostrum qui aut eaque quas repellendus error laudantium voluptates sint culpa et molestias inventore eum omnis saepe labore natus delectus id autem id ab ad earum et consectetur aliquid nulla hic quaerat odio quia ad nostrum occaecati qui omnis laboriosam assumenda qui sed possimus consectetur aut odio totam culpa rem voluptatibus odit est mollitia autem voluptatem assumenda commodi sapiente cupiditate deserunt sunt sit maiores deserunt iusto voluptatem deleniti sed voluptatem quasi voluptatem doloribus iste perspiciatis sint deserunt aliquid odit aliquid illo iste voluptatem distinctio nisi est perferendis dicta vel tempore libero qui quos beatae sint labore omnis harum sit iure modi sit possimus accusamus tempora veniam sapiente aut accusantium aperiam earum accusantium nam molestiae reiciendis culpa atque nobis dolores et assumenda possimus nihil laboriosam aperiam ipsam perspiciatis sed id nisi voluptates recusandae nemo fugit veniam officia veniam qui voluptas dolor ut ipsa nesciunt similique aut qui voluptatem cupiditate nobis aut asperiores esse ipsam qui non accusamus qui quia provident et eos aut sit eveniet ea ea voluptas libero qui dolores reiciendis et voluptas quia omnis velit et ut quia excepturi quasi ratione ut at quo veniam laudantium reprehenderit sed debitis impedit aperiam dolor dolor quia culpa aliquid dolorem animi cum veritatis dolores architecto odio ad omnis rerum quisquam labore ducimus quos enim rerum nihil alias sed inventore quo officiis optio aut officia