INSERT INTO `course_news` VALUES ('22', '3', 'Qui nesciunt sed natus maxime iure et ut.', 'Placeat sint est commodi rerum commodi animi sint eius recusandae sit laudantium alias rerum culpa quas eum eos eum eaque ut ut sapiente atque doloremque tempore tenetur laudantium voluptatibus fugiat aut perferendis ab blanditiis cum minima velit dolore et voluptatem dignissimos placeat rerum blanditiis quae quod qui repellat odio odio sunt ea est consectetur qui vitae consequatur molestias asperiores et dolore totam exercitationem rerum tempore dolores quia placeat labore voluptatem eaque autem non quia tempore eum tenetur doloribus culpa officia et velit porro qui cum placeat recusandae aut accusantium aut dolores cumque hic debitis minus ut iusto odit nihil recusandae rem ut velit enim id molestiae vel error a tempore debitis natus molestiae sint velit est et ut in quaerat accusantium minus quidem facere sit unde et voluptas quas nisi nesciunt voluptatum consequatur corporis quia deleniti in sed animi enim et cum ut vero error aut repudiandae cum sunt provident et ipsum itaque quas laudantium itaque dolores eum illo soluta neque natus quae quaerat blanditiis reprehenderit incidunt et a dolores et aspernatur aut aut ratione necessitatibus sunt culpa veniam voluptatum qui qui dolores eos reiciendis ex ipsum est iure alias labore consequatur laborum vel ut enim fugiat a libero dolores enim expedita quia est at ut qui dolor ut quis est.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('23', '3', 'Animi voluptatem explicabo et quae dolorem dolorem.', 'Mollitia vitae possimus eveniet asperiores dolore qui at iure incidunt est autem aliquid animi vitae ratione ipsam aut quibusdam totam quia quasi temporibus deleniti dicta non laborum nihil natus consequatur dolores suscipit aspernatur natus nihil beatae et totam dolorum at nesciunt cumque enim numquam qui quia est unde qui similique et saepe explicabo veritatis sint tempora ullam neque dolorem dolor possimus rerum sed et eius omnis id commodi vel dignissimos mollitia commodi est libero nesciunt et ratione totam voluptatem et optio excepturi et dolorum est sint quia et velit omnis voluptas est beatae expedita ipsum vel velit est ab et est et numquam quia placeat aut dolores voluptas vel ut aut distinctio porro voluptatem aut ab voluptas blanditiis id fugit porro est sequi dolorum esse impedit sapiente assumenda fugiat incidunt perspiciatis velit voluptatum quia aut dolorum cumque ut numquam aut sapiente quia sint eius libero repellat dignissimos minima qui id deserunt accusamus officiis ut aperiam fugit voluptates commodi error iure nostrum assumenda exercitationem adipisci distinctio repellat est sint aut impedit minima saepe quidem at accusamus adipisci eos sit id dolorum modi esse aut unde voluptatibus id quis cupiditate velit sit voluptatibus placeat officiis quod debitis exercitationem sunt perspiciatis libero aut rerum ullam ut adipisci debitis eum quis saepe magnam voluptatem vero voluptatum nostrum vitae.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('24', '4', 'Amet aut nemo modi placeat ipsam.', 'Sit sunt sapiente consectetur sint similique voluptas ut tempore odit voluptatem non illum nulla asperiores qui velit aut mollitia iusto enim pariatur praesentium a sequi sed cum aut minus nesciunt sit quaerat enim id quia quia accusamus nam dolorum id numquam veritatis vitae aut eligendi et rerum possimus tenetur culpa omnis totam in maxime et dolore soluta voluptas sit quas a voluptatum nemo aut voluptas aut molestias distinctio qui ut cupiditate inventore corporis et nobis doloremque veniam qui commodi accusantium placeat et reiciendis in voluptatem et corporis libero soluta tempora ut qui amet fugit fuga reprehenderit quis omnis est expedita consequatur voluptas sunt laborum dolorem nemo ipsam voluptatem quos aut rem consequatur occaecati nisi eum rem deserunt odio enim aut magnam velit in consequatur ipsam ipsum at eligendi libero iure alias esse earum sed dolorem sed eius est neque eaque alias quia in recusandae quia voluptas exercitationem sit reiciendis placeat iure est eos omnis et iure error quisquam sunt molestiae beatae ut velit natus eveniet aliquam consectetur dicta vel nihil magni earum necessitatibus totam in odio omnis pariatur praesentium quaerat sed id harum et necessitatibus commodi quasi aut voluptatum libero voluptatibus ipsa iusto quam doloribus et eveniet voluptas reprehenderit architecto est eveniet facere autem sequi velit ut ea qui tempora in quidem inventore ut adipisci repellendus harum cum et labore ad quas fuga expedita impedit odio molestias illum ipsam ut et quis quis velit cum non alias voluptatibus quo expedita earum mollitia aliquam ab autem error accusamus ducimus cum odio autem ut omnis nesciunt dolores quos a quo quia omnis quidem eos sed voluptas at quo vero ut praesentium eaque quisquam sint nihil doloremque provident porro aut sunt illum error molestiae praesentium assumenda porro occaecati sit.', '0', '2017-05-02 22:58:43', '2017-05-02 22:58: