INSERT INTO `course_news` VALUES ('25', '10', 'Sit repellat corporis maxime provident.', 'Eum earum nihil quisquam maiores illum blanditiis deserunt aliquid excepturi ipsum sunt dolore rerum molestias et molestiae itaque ducimus eius sapiente laboriosam quibusdam voluptatem eaque beatae occaecati quia nulla sed quis qui magni hic facere maxime eaque corporis voluptas id quia facere fugit qui rem exercitationem aut iste doloremque id perferendis dolorem nesciunt impedit culpa iure molestiae ullam modi quaerat sed quae amet amet aliquam rem est dolor sint aut voluptatem sed et placeat eum doloremque eum suscipit qui debitis aliquam quis est laudantium voluptates qui cupiditate pariatur sint molestiae beatae ea perspiciatis ipsam quis nihil sequi omnis excepturi consequatur et aut ut aut at ut eius repellendus ea aspernatur tenetur laboriosam corporis illum repudiandae explicabo fugit odio autem velit totam excepturi voluptas voluptatem dolore nisi tempore quibusdam molestiae sed et debitis optio velit totam qui magni voluptas aut sed quas est rerum tenetur eaque cumque id rem iusto est animi iusto a quia ducimus velit error modi nihil odit exercitationem pariatur a quaerat rerum commodi facere nihil asperiores ut quae ad tempora magnam beatae dignissimos delectus qui at est voluptatem at sed laborum qui cum dolorum sit minima ea architecto et id dolores et iusto sed voluptates reiciendis incidunt dolorem facere natus est vitae culpa autem sed distinctio corporis suscipit et aut ex facere quia dolorem autem atque occaecati non quisquam alias libero magnam rerum nisi qui aperiam occaecati quas est nihil et harum nihil atque recusandae est soluta asperiores possimus perferendis velit repellendus sunt est natus doloribus quod quo iste et neque omnis dignissimos eos quibusdam cum laboriosam placeat id omnis consectetur deleniti harum minus quos dolor delectus voluptatum consequatur alias voluptatem error ea aut quis ut molestiae qui ipsum consequatur in omnis voluptas dolorem aliquam aperiam ipsum occaecati culpa nisi velit ad non adipisci saepe natus quos est dicta voluptates laborum est est saepe dicta quia ex possimus omnis natus rem accusantium harum blanditiis sit nemo et perferendis et aspernatur dolorem nulla qui amet deleniti earum deserunt autem id cum nihil fugiat inventore esse et et tenetur possimus quaerat expedita quo vero quaerat ratione voluptas delectus iusto qui corporis ut debitis ullam qui assumenda adipisci et modi porro.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('26', '8', 'Sed hic aut eius consequatur enim.', 'Quis totam saepe ut accusantium ut ut voluptatem et quia similique ex quaerat quis numquam fuga ipsa quia suscipit quas saepe rerum soluta corporis facere blanditiis iste adipisci nemo assumenda accusamus voluptate nemo occaecati aut et tenetur consequatur eum sint et ipsum iure exercitationem inventore qui ad deserunt pariatur harum laudantium minima cum eos quibusdam minima repellendus dicta cum illo quia facilis laboriosam adipisci exercitationem velit sint ut reprehenderit excepturi veritatis voluptatibus officiis et voluptatem enim error quaerat ipsa aspernatur dolor eos suscipit vel aut quo quia velit et sunt quia quia quia ut ipsa in occaecati maiores praesentium accusantium error doloribus aut blanditiis omnis eveniet quae porro dolores odit dolor delectus atque aut molestiae atque enim beatae impedit repellat nulla nemo blanditiis sed nam velit eum saepe deserunt consequuntur praesentium qui eum est architecto beatae mollitia ab enim ipsum unde odit magnam beatae ipsam perspiciatis unde sed ratione aut fugiat minus dolor aliquam cumque omnis voluptatibus magnam excepturi iusto quo possimus quidem ipsam culpa soluta accusamus ex autem sint nobis molestiae vitae similique mollitia modi ea tempora perferendis ab vel veritatis aut quisquam velit vero praesentium voluptas aut quas ipsum inventore quia tempore eligendi sed repellendus aut explicabo atque suscipit perferendis perspiciatis reiciendis rerum beatae nihil sed assumenda saepe veniam veritatis ad error eos corrupti quam dolore doloremque reprehenderit qui deleniti dolorem et dolores doloribus temporibus amet sapiente nemo voluptate ducimus iure omnis modi sit est facere officia enim nisi et vero assumenda.', '0', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('27', '8', 'Quia non quibusdam consequatur sunt occaecati consequatur tenetur.', 'Recusandae tenetur ea quisquam optio illo alias soluta aut provident doloremque debitis soluta cupiditate id saepe repellendus placeat eius ratione et molestiae non aut enim unde nihil nihil consequatur quaerat qui quia voluptas exercitationem harum praesentium distinctio et inventore ea et autem quo quisquam non assumenda qui doloremque est ut ad aut laboriosam rerum quam ut et sint vitae error sed dolor et quo sed et odit vero est accusamus dolorem sunt et ut in non ea consequatur doloremque et sed quo maxime aut laboriosam rerum qui porro enim et et omnis ut voluptatem eaque laudantium culpa sunt voluptates earum molestiae minus esse nostrum beatae a neque officiis quis delectus vero itaque odio est qui sed sint voluptas inventore consequatur laboriosam ut qui sunt qui error sint consequatur maiores eum aut ut suscipit id nulla repellendus ex enim ut laborum pariatur accusantium corrupti adipisci minima veritatis aperiam deserunt eaque laboriosam a dolores rem tempora iure nisi hic quia incidunt aut consectetur vel velit repellendus blanditiis animi placeat sint sint et maiores excepturi voluptas laudantium quaerat deleniti aut nulla quis iure saepe non ea itaque possimus rerum repudiandae natus eligendi alias in perferendis id blanditiis occaecati dolores illum in dolores debitis ex quia voluptas id non officia esse minima qui velit id similique hic iusto commodi sed ad nemo suscipit nobis et possimus cum dolor deserunt quae id ipsa aliquid facilis nostrum rerum impedit quasi qui hic minima debitis possimus nihil qui odio doloremque voluptas aperiam illum nemo quia molestiae est aperiam facere fugiat quia vel doloribus molestiae tempore qui et qui id ea vel officiis voluptates ipsum aut aperiam nesciunt iste velit fuga sit eum aut explicabo dolor natus sit mollitia voluptate commodi sint commodi maxime optio et eum officia laudantium blanditiis nob