INSERT INTO `course_news` VALUES ('28', '3', 'Aut et ex fugit placeat laboriosam in.', 'Enim asperiores consequatur reprehenderit consequatur nostrum sit libero magni facere debitis et et nam delectus ut rem dignissimos in dolorum iusto qui eius repudiandae dolorum tempore repellat odit sunt et quis quia facere et consequuntur ea nostrum in itaque et autem provident ex pariatur veniam est ea non nesciunt reiciendis ipsum ab qui amet ut repellat et sunt ut at nisi mollitia similique cumque illo esse numquam aut numquam iure eius totam aut deleniti consequatur earum magni dicta illo aut alias sint mollitia quod aperiam esse et rerum consequatur sit dolorem at eaque consequuntur aut sit molestiae cupiditate nesciunt qui error adipisci sed qui quae voluptatem quod culpa ratione repellat et explicabo ad rerum eum beatae in et quos quia eos alias omnis eveniet possimus qui voluptatem et eum cum exercitationem harum quod in nihil autem veritatis nobis eos soluta aut eos eius mollitia velit culpa sequi est dolores tempore eos libero velit modi iusto animi eos vero fugiat sit sunt facere perferendis illum similique ipsa rerum ut autem molestiae atque est omnis animi autem veritatis libero dolorum aliquam ullam provident expedita quo ab et in aut officiis nobis minus vitae molestias aut optio dolorem voluptatem nostrum eius delectus velit aliquid nobis velit dicta perspiciatis pariatur consequatur facilis quos tenetur saepe neque tempore architecto excepturi debitis et at sed est et autem incidunt distinctio aut rerum eum est velit possimus et repellat quidem laborum facilis quia in sequi dolorem voluptatum beatae sed soluta qui sunt atque est et qui autem ea corporis omnis et nulla vel id quia et quia rerum quia id labore voluptates accusamus tenetur perspiciatis excepturi voluptatem et est rerum impedit blanditiis tempora temporibus facilis omnis ut vel eius harum atque assumenda tenetur minima repudiandae enim harum optio pariatur beatae doloremque rerum exercitationem molestiae vel velit dolores sunt a explicabo a incidunt saepe harum adipisci adipisci eos consequatur cumque ipsam nisi sit est quia sunt aliquid.', '0', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('29', '2', 'Eos animi iste beatae voluptas quia.', 'At inventore nihil rem sit placeat esse sint et dignissimos repudiandae voluptatem autem ut velit occaecati corrupti necessitatibus aliquam maxime a illum expedita dolorem ut commodi esse sint quae minima ea rerum delectus unde aperiam dolorem numquam aut ullam ea et necessitatibus libero quas quis aliquid exercitationem porro autem et optio impedit delectus numquam temporibus molestias consequatur eos voluptate aliquid repudiandae commodi repellendus excepturi ullam deleniti consequatur dolores recusandae ut quia eum quasi quos voluptatem quas aut autem laborum qui explicabo rem assumenda dolorem dolor quis aut recusandae et sunt odio repellendus laboriosam in dolor quae quia cupiditate expedita quae doloremque hic ut voluptas totam architecto placeat vel modi qui beatae quia et et ut suscipit sunt eligendi odit vitae maxime et harum repellendus cumque voluptas porro voluptatem dolorem vel laudantium repellat sapiente quibusdam omnis iste possimus dolorem aut facere adipisci blanditiis nihil earum et deleniti eos repellendus quaerat aut repellat quaerat et tempora modi nisi ab praesentium quidem dolore quisquam consequatur quae harum cumque porro ea rerum et vel quam veniam iste dolorem et facere sed repellat repellat id sequi autem consequatur quia voluptas suscipit dolore voluptas quisquam qui enim ea cupiditate nulla harum sint odio sed molestias reprehenderit aut placeat ut est unde voluptatem quam ut et exercitationem eaque voluptatem natus eum architecto provident omnis vel accusantium et maiores saepe repudiandae laborum similique nulla nisi similique necessitatibus voluptatem autem sunt tempore non mollitia in deleniti molestiae facere quis quae ipsa cum architecto nostrum temporibus voluptatem repellendus expedita esse atque et ipsum aliquam qui necessitatibus molestiae a vitae accusamus eligendi est dolor rerum mollitia necessitatibus labore numquam quisquam omnis minus nobis nihil ullam porro dolor facilis qui aliquid odit ad similique autem ut omnis veniam omnis est necessitatibus veniam quia veritatis ea nam omnis in doloribus eos odio exercitationem eius asperiores aliquam quas numquam eum molestiae autem qui aperiam minus eveniet qui iste temporibus eum consectetur velit sed iste aut error assumenda alias quia eius omnis alias reprehenderit et inventore voluptatem a quos sed mollitia exercitationem qui voluptatem commodi vitae velit quisquam incidunt quia voluptatem asperiores laudantium voluptatem quasi quia et vero sed odio consequatur et repellat earum cum vel adipisci numquam ut ipsum facere officia.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('30', '7', 'Vitae consequatur enim est.', 'Facilis ut blanditiis tempora occaecati facilis in maxime est aperiam eveniet impedit nihil inventore blanditiis error nobis quisquam quae cupiditate et accusantium eos cum nesciunt enim enim quaerat aut non eos et et impedit sed minima dolor aliquid sapiente non nisi corporis consequatur ut quae pariatur id enim commodi vel quia amet similique placeat excepturi fuga sit autem odio tenetur dicta repellendus autem autem dolorem id consectetur qui vero magni voluptas omnis blanditiis enim qui nemo quaerat et facere et in vitae qui odio minima dolorum magni accusantium nihil sed eaque et voluptas harum est impedit id molestias eos dolorem dolorem et perspiciatis necessitatibus quidem esse consectetur magni aut pariatur consequatur qui rem sed debitis nostrum et dolor vitae eum ut nulla enim nemo velit optio modi asperiores aut omnis perspiciatis laboriosam qui nisi quo numquam enim reiciendis inventore non architecto totam ad ullam corrupti nulla quasi nisi aut tempora reprehenderit cupiditate hic nihil voluptatem vel quae delectus quia veniam ea illum natus quis distinctio molestiae atque eum neque velit accusantium mollitia perferendis dolores ut dolores neque a numquam nemo deserunt expedita cumque nesciunt eum sint sunt assumenda sed totam ut veniam fugit perspiciatis et provident laborum repellendus quam ex dolorem debitis est optio quia voluptatem minus amet quaerat nostrum et aut dolores quisquam qui et aut nihil hic ut aut ullam quis eius nihil eveniet vero quibusdam amet qui voluptatem est tempora fugit sit quia vel tempore nesciunt at aut et delectus dolores voluptas non nobis aliquam dolorem ducimus voluptatem aut architecto enim est quisquam aliquam repellat vitae quis est hic in laboriosam iste magnam consequatur pariatur voluptas eligendi dolores autem harum sunt sunt reiciendis perspiciatis error eius enim veniam ea inventore et expedita nemo fuga totam dolorem ut et consequatur