INSERT INTO `course_news` VALUES ('31', '10', 'Rerum est illum quisquam impedit porro.', 'Nihil non in est et blanditiis deleniti dolorem pariatur autem natus repellendus alias atque ut eveniet eos ullam itaque quia dolore excepturi molestias libero occaecati explicabo saepe vero dolores vero saepe ut accusamus illo distinctio hic pariatur quisquam ut sunt voluptatem sapiente ut unde ratione amet quis praesentium incidunt possimus exercitationem sit vel ipsum placeat labore esse eius tempora aut sed et non doloribus aut non optio eos explicabo ut unde quae illum animi soluta vitae aliquam aspernatur doloribus illum minima dolor doloremque molestiae atque quis sapiente cumque quia aliquid saepe omnis magni accusamus labore consequatur vel dolorem qui modi aut aut quod quisquam velit est possimus nulla qui non a sit eius explicabo alias magnam eligendi labore magni libero itaque officiis eum autem architecto magnam neque eius laudantium ut ut sint debitis commodi culpa sit est modi ea et sit quia vitae repellat voluptatum dolorem numquam eum sint praesentium reprehenderit doloremque quis et eos adipisci illum animi pariatur ipsa omnis et et commodi quam consectetur quo ut quis aliquam corporis vitae repudiandae eos voluptate adipisci et dolorum illo doloremque ducimus quod quia non dolorem sed eum voluptate et qui beatae consequatur eos et ut eius eos nisi illo.', '0', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('32', '3', 'Quia sequi et non accusamus.', 'Eum dolore est omnis quaerat asperiores voluptas consectetur a facere ut qui iste sit aut libero vel tenetur assumenda odit omnis occaecati repellat vel eveniet veritatis dolores aspernatur nisi architecto ipsam reprehenderit cum dolorem eligendi qui quia debitis odio recusandae magni at fugiat sint libero tenetur eaque minus aliquam soluta porro in dolorem aut odio velit est corrupti laudantium quas consectetur dolores voluptate qui eum quo alias quisquam iste voluptatem eos aut reprehenderit aspernatur eos voluptatem est aut ut sit et numquam atque magni officia dolores corporis est vel nemo expedita pariatur sequi esse tempore assumenda occaecati necessitatibus at et ullam aliquid deleniti in qui corrupti blanditiis occaecati facilis vitae accusantium quia eum quis sapiente rerum tempore enim est consequatur iusto quibusdam ipsum omnis aut quidem debitis inventore inventore et officiis qui assumenda expedita sapiente error in non sint harum ea hic quidem voluptates eaque alias ullam aut sit officia corrupti inventore sint est iusto ut omnis molestiae assumenda laboriosam voluptatem porro at at pariatur totam ex et est est labore quaerat et dignissimos quisquam quidem voluptatem qui aut amet ut totam ratione omnis enim repellendus expedita placeat animi nesciunt maxime ut pariatur sed cumque ab quis commodi eaque iure sunt nihil libero quia quo consequatur molestias beatae quis voluptatum enim eius sequi eligendi velit suscipit fugiat ea blanditiis et ex porro laudantium incidunt eos quo unde deserunt perferendis reprehenderit beatae autem consequatur fuga pariatur ut aut rerum modi iure eum incidunt natus blanditiis laboriosam odio laudantium et voluptates alias illum harum enim natus est officiis hic harum nulla temporibus praesentium quis quo velit animi voluptatem eos quibusdam qui ut ut id et consequatur consequatur eum ullam qui aut et vitae in quos ea eveniet autem consequuntur magnam eligendi accusantium voluptates vero accusamus iusto et nulla natus aut ipsam eum laborum voluptas omnis illo cum molestias est molestias accusamus atque ratione voluptate tempora voluptate ut ut.', '1', '2017-05-02 22:58:43', '2017-05-02 22:58:43');
INSERT INTO `course_news` VALUES ('33', '4', 'Et aut minus enim amet.', 'Voluptatem voluptas recusandae consequatur voluptatem voluptates labore eos sed ullam ducimus est tempora consequatur possimus aut est vel perferendis et ullam odio saepe accusamus voluptate vero dolorum nihil facere dolorem optio et voluptas qui sequi quia totam dicta corrupti autem veritatis id possimus est quos dolores quis commodi et ut est id reiciendis neque omnis architecto laborum ipsam esse quia impedit laudantium et consequatur provident illo quia autem et voluptatem aut asperiores non ut nobis fuga consequatur dolorum omnis soluta iure necessitatibus quasi quos animi quia consequatur explicabo dolorum officiis vel dolorem voluptas delectus minus nostrum quas ut mollitia quam voluptatibus quo itaque excepturi tempore doloribus non ratione itaque illo ut possimus nobis aperiam non placeat aut voluptatem occaecati doloremque possimus aperiam numquam sit eum et et qui quas temporibus voluptatum nihil nostrum eos rem et officia consequatur magnam sunt qui perferendis quia dolores incidunt ea eos est distinctio quis ut pariatur adipisci sint eos non dolorem aut accusantium et fuga architecto earum accusamus quas blanditiis enim sit ducimus alias vero quia reiciendis eligendi sunt eos quia aspernatur dignissimos culpa deleniti ipsam ut nobis aut sunt cum qui numquam vel nam facilis et ea est delectus rerum tenetur nemo quia facilis molestiae rem pariatur eum veritatis tempore expedita pariatur fugiat ut pariatur animi deserunt mollitia omnis ea laudantium temporibus aliquam qui optio non dolore occaecati et omnis debitis non dolores nihil id et qui eum nemo perspiciatis ex quibusdam dolore hic quos dolorum ad neque aliquam occaecati soluta soluta consequatur hic eos et eum non in facere voluptatibus sint impedit iste consequatur odit et distinctio inventore veniam blanditiis et illum iste hic nesciunt cum et porro tempora quis dolor sint incidunt iste quia aut commodi placeat facilis vero e