INSERT INTO `course_news` VALUES ('35', '5', 'Minima vel incidunt nihil rem qui ipsa quidem vel.', 'At dolor dolorem magni laudantium earum qui laboriosam dicta provident ut nisi quia ad numquam eum qui rerum et totam voluptatem et officia libero debitis beatae harum beatae porro ut sequi dolores voluptate voluptatem aut maxime qui nobis quos et architecto eius suscipit molestiae corrupti vel aut sed velit expedita sed autem id numquam quod et est dolor veniam optio placeat consequatur sit fuga expedita quidem voluptas doloremque quis nobis voluptas corrupti non eum laudantium non et voluptate libero aliquam nostrum ipsum dicta aut totam est quibusdam sed alias eius id maiores nam similique itaque doloribus recusandae nesciunt distinctio similique dolores omnis odio a officiis itaque cumque qui expedita veniam sed neque facilis et nesciunt et aperiam sit repellendus corporis similique minus impedit pariatur ut quo eos sit sit ut et quibusdam consequatur quia itaque qui est et ratione optio quis magni a amet assumenda quis est accusantium quis distinctio qui dolore quidem hic non recusandae repellat quidem asperiores exercitationem a quo repudiandae qui qui voluptas omnis nisi voluptas consequatur velit et et et est eligendi minima velit at ut natus nulla placeat similique repellendus fugiat quo maxime omnis necessitatibus rerum eveniet quos sint in deleniti totam ad quo quia optio dolore asperiores voluptate aspernatur atque occaecati est cumque architecto ut at beatae provident debitis ipsum vero tempore et provident in error quibusdam ut nostrum fuga debitis dolore quisquam explicabo quia a ducimus cum aut quibusdam inventore necessitatibus hic enim omnis et aut et beatae minima temporibus voluptas quod quis quasi omnis quam in eveniet quidem eos molestiae distinctio non pariatur minima corporis at qui itaque perferendis ea.', '0', '2017-05-02 22:58:44', '2017-05-02 22:58:44');
INSERT INTO `course_news` VALUES ('36', '3', 'Ducimus ut quo provident vitae provident saepe sed.', 'Architecto est sint debitis asperiores qui iure molestiae ex expedita suscipit sapiente ullam rem fuga eaque aut ut eum temporibus illo non quia eaque dolorem excepturi saepe sapiente qui qui error voluptas quaerat velit culpa illum omnis repudiandae qui voluptates nesciunt velit minima nam sequi amet numquam possimus laudantium in dignissimos nihil adipisci earum maiores quam quae eos ut eius aperiam earum itaque ipsam voluptas distinctio incidunt qui molestias molestiae libero saepe unde ut quis itaque sit iste excepturi et recusandae quia magni repudiandae maiores provident sint in quia provident quia ipsum soluta rerum perferendis et ut delectus velit sint aliquam voluptatem harum aut alias sed vel natus cupiditate pariatur vel consequatur ut perferendis sed occaecati voluptas aut adipisci sit debitis sed suscipit repudiandae ipsum et repellendus qui aut totam vel quae rerum qui odio nam nesciunt perspiciatis earum nulla nisi maxime ut eius ipsum libero omnis ratione suscipit ullam necessitatibus odio in qui provident maiores possimus facere est enim minus omnis aut et et ut aut et ut architecto et architecto unde dolorem eligendi eveniet fugiat aliquid est veniam laborum labore qui velit laborum perspiciatis maiores laudantium et quia sint libero et sit natus qui magni id quia sapiente molestias et cupiditate vel a consequatur eos quod aperiam est et dignissimos recusandae deserunt nobis ut alias velit vero facere nemo eum cupiditate ex totam aut aperiam qui facere saepe animi porro labore quia voluptatem veritatis accusantium non voluptatem corrupti corrupti et numquam molestias aut maiores ad illum totam et error autem perferendis a sit sint vero omnis eos voluptatem qui reiciendis ex eveniet praesentium qui ducimus tenetur corporis quis eos debitis sit velit et sint corrupti debitis at nihil itaque eius quia unde omnis fugiat alias repellat perferendis labore