INSERT INTO `course_news` VALUES ('38', '4', 'Ea velit earum voluptatibus omnis dolor.', 'Eaque quasi incidunt impedit molestiae non veniam non officia quo ipsa molestiae iusto dolores odit ut quisquam voluptatibus velit quas voluptatem ipsam est et quia eaque optio sunt est omnis assumenda natus ut enim numquam reiciendis repudiandae officia ut et temporibus quas sit repellat sit eius veniam quibusdam animi distinctio in illo adipisci assumenda voluptates voluptatem quia sunt quam iusto dignissimos sed harum vel error sunt accusamus ut ut rerum hic repudiandae non consequatur repellat laboriosam maxime cumque fugit debitis fuga laboriosam sint rerum voluptates voluptas a natus eos quis recusandae rerum corporis aliquam rem sit quia laborum ut porro quam sit consequatur cum aut qui velit vel neque vel autem soluta voluptas et qui autem qui sit earum eveniet corrupti dolore asperiores hic libero et et quasi deserunt unde et aut et quas laboriosam tempore mollitia nobis neque ut dicta molestiae distinctio quia maxime tenetur consectetur distinctio et aut nulla reprehenderit ratione facilis amet autem ut quo rem ipsa id voluptatum totam non deleniti tenetur rerum cupiditate aspernatur rem delectus et atque quia facilis corporis deleniti quas voluptatum et sit rerum et consequatur error velit quaerat ut id quaerat sit suscipit consequuntur itaque repudiandae doloribus iste sint quis unde eligendi exercitationem assumenda est dolor totam ut ipsam quidem distinctio sunt voluptatem iste cum impedit velit doloremque aut qui sit rerum quos necessitatibus exercitationem quam ipsa qui praesentium et doloremque odio deserunt voluptatem vel quas sapiente tempora labore voluptas a nisi hic vel dolorum adipisci placeat aut natus vel nemo voluptatem dolore illo placeat sint ut veritatis velit placeat molestiae est sint aperiam rem voluptatibus blanditiis ut adipisci earum vero voluptatem assumenda qui labore aut est voluptas vitae aliquid quo quo ut maiores velit velit omnis sunt e