INSERT INTO `course_news` VALUES ('39', '10', 'Odit rerum maiores reiciendis sit facilis non.', 'Ea qui quo dolorum rerum provident quia dolor temporibus sed facilis exercitationem enim quis rerum dolorem exercitationem architecto eligendi tempore eligendi totam voluptatibus recusandae impedit quos iste alias rerum ab sequi sequi illum quaerat necessitatibus et quis vero dolorem ipsam architecto ut et explicabo voluptas odio quo consequatur nihil id et quas facere error est quia eligendi explicabo sed accusantium aut velit fugiat esse alias nobis molestiae omnis quidem officia itaque officia voluptatem molestiae iusto ratione explicabo aut quis magni minima neque et velit dolor provident soluta illum vel explicabo beatae nam delectus officiis distinctio modi porro consequatur ut ut voluptas rem et vero quam autem dolore sapiente commodi amet rerum non quibusdam inventore consequatur non quos aperiam itaque vero nulla deleniti neque deserunt quis aut voluptatem reprehenderit tempora repudiandae placeat voluptatem neque voluptatem at ut tenetur dolores fuga est libero quas accusamus optio placeat modi ut inventore perferendis dolores officiis aspernatur et consequatur accusamus excepturi labore iusto ut possimus vitae occaecati voluptatibus esse rerum similique architecto quas cumque ipsum distinctio eveniet et dolor consequatur et repellat dignissimos voluptatem ipsam qui sed adipisci quis aut sed fugit molestias est consequatur ipsa et at voluptas corrupti consectetur sapiente sapiente voluptatem nemo labore quia aliquam illum natus aut est eaque numquam est quo et sint fugit consequatur voluptatum ut et excepturi autem et nulla fugit accusantium debitis consequatur doloremque omnis in est in et minima modi non nisi minus iusto in autem assumenda facere omnis corporis illo sed atque dolor deserunt atque beatae harum omnis rerum ipsum cumque voluptatum voluptatem qui corporis sequi tenetur nesciunt corporis in adipisci quia autem quia distinctio et sunt alias volupta