INSERT INTO `course_news` VALUES ('40', '1', 'Autem et possimus mollitia blanditiis et nemo.', 'Consequatur fugiat asperiores nulla rerum ducimus qui qui aut temporibus voluptatum eveniet voluptatem voluptas et voluptatem incidunt reprehenderit aut ut est sequi consequuntur porro asperiores omnis magni accusamus quibusdam optio veritatis reprehenderit incidunt id voluptas iusto error et sequi ea ut consequatur rerum dolores voluptas illo doloribus cum repellat quis ea eaque perferendis et non est quia cumque autem veritatis rerum accusamus eum atque quasi dolorem et fugiat excepturi voluptatum nemo dolor libero saepe aspernatur voluptas eligendi eaque maxime earum aut optio ipsam optio quibusdam suscipit totam excepturi delectus aut nihil consequatur nulla aut et in alias commodi nemo vitae perspiciatis sunt voluptatum occaecati sit perspiciatis quis aliquid quia exercitationem quasi ab et fuga qui aut fuga voluptatum beatae sapiente hic necessitatibus sed enim eum ex rerum omnis odit quasi placeat aut deleniti qui architecto necessitatibus velit consectetur porro provident et atque a delectus voluptas beatae placeat doloremque molestias voluptatem commodi ut maiores ut doloribus vitae voluptatem ex sit ut quia soluta tempore architecto blanditiis delectus voluptatem facere et explicabo doloremque et voluptatem nihil magni nisi sed deserunt amet totam repudiandae autem quis alias iusto vitae voluptas ipsa facilis provident quod impedit asperiores enim quae quod earum vel animi minus aut voluptatem et non iure itaque aut enim aliquid incidunt quisquam harum dolores id temporibus veritatis velit similique neque atque corrupti asperiores ex modi et ipsa ipsa adipisci sint qui recusandae neque.', '0', '2017-05-02 22:58:44', '2017-05-02 22:58:44');
INSERT INTO `course_news` VALUES ('41', '9', 'Quisquam id consectetur dolores consequatur.', 'Corrupti ullam dolorem nulla harum culpa dolores officia quibusdam maxime fuga officiis qui molestias sed aliquam aut assumenda sed omnis exercitationem aperiam error quas debitis porro et officiis qui laboriosam laudantium ut minima aspernatur nihil exercitationem similique excepturi enim omnis magnam ipsam consequatur eos et est eligendi laudantium est fugit beatae aliquam dolorum saepe est tenetur atque quis quas porro nulla suscipit ducimus quia recusandae eos reiciendis eos ea impedit sint hic nisi consequuntur sequi quidem pariatur dolores magnam necessitatibus non tempora ab quia sint reiciendis qui nam sed vel necessitatibus inventore architecto iusto itaque autem unde facere a voluptatibus debitis corporis sed veniam odio omnis placeat ut quasi corporis ad quasi autem iste commodi cum ipsum aut ut reiciendis ratione totam voluptatibus deleniti officiis enim provident facere voluptatem mollitia omnis facilis omnis consectetur fugit voluptates voluptas necessitatibus magni totam ab nihil accusamus doloribus earum qui illo non mollitia aut nihil quia necessitatibus libero quia sunt est sint nisi quaerat numquam illum minus quibusdam nam molestiae qui atque iste voluptatum dolorem debitis aliquid facere provident quis sit labore quas accusamus sint dicta vero dolor quam omnis voluptatem quae et deserunt alias rerum iste voluptatem expedita earum et facere consequatur voluptatum necessitatibus iusto placeat rerum voluptatum sed ipsum cum voluptatem aperiam aut voluptate ut sit dolores saepe aut aperiam nam voluptatem nisi non illum quis est iure vero culpa earum molestias eius eveniet.', '1', '2017-05-02 22:58:44', '2017-05-02 22:58:44');
INSERT INTO `course_news` VALUES ('42', '7', 'Minima aliquam quibusdam minus in.', 'Voluptatem quam quisquam dolor atque laudantium ratione temporibus aliquam temporibus ipsam velit sed cumque non sunt ipsam maxime saepe est culpa iusto cum et pariatur id omnis saepe earum voluptas minus dolores pariatur illum libero architecto est incidunt suscipit sed iure atque id aut veritatis sequi distinctio excepturi dignissimos ipsum qui est quidem tenetur quod autem aut sed dolorum sint qui enim esse hic nobis quasi consectetur aperiam quod porro veritatis officiis nihil repudiandae sint ipsam temporibus rerum dolor debitis aperiam autem nulla et distinctio dolorum nobis aut magni accusamus natus aut eligendi est eveniet quo a quis facere id dolores quidem magnam qui eos unde repellat quam corrupti cum in nulla voluptates ut distinctio blanditiis ullam minus quaerat suscipit quam similique qui dolorem dolore est qui et nemo quod numquam non aperiam velit ut quidem nihil et consequatur rem maxime impedit voluptatem qui et dolore porro aperiam aut fuga occaecati esse distinctio quia soluta aut perferendis quia accusamus nostrum optio reprehenderit voluptatem ipsum delectus id dicta beatae dolorem tempore veritatis autem aliquam ipsa perspiciatis ipsa ut est enim repellat at sunt natus sit ut modi nesciunt et odio autem ut accusantium officiis cupiditate ea eaque quis rem qui aperiam aut asperiores quis voluptas minus molestias ipsum officia quo inventore labore officiis quia ducimus laudantium mollitia dolorem culpa ullam cupiditate in nihil dignissimos nihil ut vel unde aspernatur a atque voluptatum voluptatem magnam cum aut.', '1', '2017-05-02 22:58:44', '2017-05-02 22:58:44');
