INSERT INTO `course_news` VALUES ('44', '9', 'Molestias et adipisci dolores aut harum nostrum.', 'Ipsa ipsam cum possimus aut et voluptatem et fugit aut qui sed aut nisi deleniti aut possimus neque est veritatis nam nesciunt laborum aliquid quia deleniti nemo omnis est aut autem alias necessitatibus voluptatibus eius natus quibusdam autem officia et aperiam voluptas aut odio rerum voluptatem asperiores aspernatur reiciendis iusto aut praesentium cupiditate eos officiis officiis blanditiis nobis velit sit odit aliquam aliquam debitis in enim et occaecati ullam voluptatem consequatur placeat vero qui libero harum exercitationem nesciunt culpa et enim quam facilis est placeat molestiae fuga eius quidem laudantium numquam voluptates accusantium ipsam deleniti ipsa dolorem et fugit explicabo esse consectetur fugiat non ut culpa omnis rerum nulla recusandae et iste recusandae sunt eum soluta minus aut eaque animi nobis iusto officiis qui et eius magnam fugiat odio eius enim magni eius earum aliquam dolores quo aliquid et non aut ullam asperiores et facilis fugit sit ut pariatur quia unde accusamus eveniet quasi atque quae voluptates provident dolorum in similique quis repellendus sit sapiente modi rem sit voluptas velit aut nisi et hic voluptatibus necessitatibus ut eum esse nam culpa dignissimos distinctio qui aliquam quae vero id neque animi quo dignissimos qui et dolorem a harum amet et ut odit repellendus voluptatem esse quis harum eum totam molestiae error voluptates odio rem et exercitationem dolor illum et laborum voluptatem est quo doloremque quaerat doloribus eveniet quia nemo sint animi et rerum in animi qui assumenda quis non quae est expedita quod omnis error officia voluptas qui facere et alias dignissimos molestiae provident harum ducimus nam nobis non dolor ut omnis dolorum ea ut explicabo dolores ea unde nihil ut tempora ipsa dolor minima ea ipsam animi dignissimos itaque eos saepe officia aliquam eaque quos debitis et assumenda et aliquam enim necessitati