INSERT INTO `course_news` VALUES ('45', '10', 'In quia ut quis laboriosam ipsa mollitia sed.', 'Ut ratione nostrum ea accusamus adipisci saepe possimus tempora molestiae voluptatem impedit doloremque qui assumenda sit possimus veniam laboriosam doloremque autem officia itaque perspiciatis ut inventore aspernatur ut molestias consequatur aut velit nam minima quisquam molestiae rerum nemo numquam impedit et aperiam dolores quae voluptas repudiandae molestiae voluptatum natus ut explicabo consequuntur ratione molestiae magnam porro qui facilis assumenda quia aut mollitia quod expedita soluta consequatur dolor distinctio deleniti aliquid vel repudiandae voluptas ullam vel omnis neque exercitationem sequi dolorem rerum voluptatem provident quidem et ut rerum quis pariatur at quia dolor similique dolores repudiandae facilis officiis minima debitis facilis quo consequuntur incidunt iste molestiae ut placeat enim ipsam deserunt est distinctio tempore provident earum quos et eligendi et atque repellat et natus voluptatem enim possimus quia doloribus maiores et ducimus mollitia labore autem natus officiis odio quae nihil beatae adipisci a cupiditate odit et vel iure laboriosam quis quidem eum quo accusamus illum in odio eaque nesciunt ea quia et quidem labore ex accusantium quia qui animi beatae dignissimos velit quo architecto animi distinctio minus temporibus sit error quae harum voluptas doloribus aut consequuntur dolor eos molestias velit praesentium sapiente pariatur corporis quisquam et et vel rerum iste dolor at illum ab dolores sunt maxime eos exercitationem sed neque quia dolorum ut voluptatem accusamus totam ad nostrum non ad ut facilis deserunt voluptatem impedit tempora est velit sed laboriosam omnis nostrum doloribus quod corrupti qui perferendis corrupti iure eius quia error laborum quas ab voluptas cum esse odit et nisi libero vel non quis dolore harum in laboriosam omnis doloribus soluta iste voluptas aut aperiam a accusantium omnis commodi at ut ut consequatur possimus rerum voluptas dolores ipsa et eaque esse explicabo dolorem vel rem et vel non ad voluptas harum aspernatur officia et molestiae itaque fugit sunt dolor maiores qui officiis omnis.', '0', '2017-05-02 22:58:44', '2017-05-02 22:58:44');
INSERT INTO `course_news` VALUES ('46', '5', 'Veniam dolorum dolorum odio ab dolores accusantium ut.', 'A voluptas labore facere odit sit molestiae natus mollitia et possimus ad cupiditate ut ea reprehenderit quam sit occaecati officiis praesentium enim consequuntur ut vel quibusdam nihil aut ut sit cumque iste et debitis ut est commodi iure fugit deleniti dolores et consequatur et neque ut totam sunt dolores maiores corporis quibusdam et assumenda voluptatem et odit quae veniam assumenda sint beatae fugiat est laudantium fugiat pariatur quos itaque ut quaerat assumenda ut voluptate rem sunt reprehenderit esse sequi aspernatur perferendis hic minus officia sit voluptas non impedit est cupiditate cum sunt neque odit reprehenderit dolor quisquam occaecati fuga animi in non quibusdam fugit ipsam sint velit sapiente vero est minus autem voluptates officia ea aut id provident voluptates consectetur et ut ut nostrum ea nemo labore perferendis eius minus molestiae ea sit pariatur asperiores reiciendis tempora quisquam cupiditate optio culpa vero occaecati et in culpa modi itaque suscipit sed nesciunt suscipit quia repudiandae et unde tempore magni provident dolor porro autem est autem ut at qui provident expedita consectetur unde facilis sequi aut quos voluptatibus fugit vitae fugit consectetur inventore dolorem deleniti consequatur iste non sed adipisci quidem facilis velit minima inventore dolore doloribus qui.', '1', '2017-05-02 22:58:44', '2017-05-02 22:58:44');
INSERT INTO `course_news` VALUES ('47', '8', 'Quos fugiat consequuntur iusto facere.', 'Porro magnam quo aut id dignissimos ex praesentium incidunt provident id et delectus et itaque laboriosam perferendis explicabo dolorem nostrum est consequatur ut maxime consequatur qui facilis reprehenderit tempore et id eius debitis ipsa expedita nisi quo fuga quia dolorem quis similique maiores autem odit earum quia non corporis sed asperiores doloremque cumque fugiat perspiciatis accusantium delectus tenetur voluptatem aliquam blanditiis quae et aliquid totam fugit fuga reprehenderit aut voluptatem recusandae dolores ut sed nesciunt quas distinctio consequatur quia laudantium voluptates laborum quidem delectus totam perferendis placeat culpa repudiandae consequuntur vel et dolores quibusdam aperiam sunt sed sed soluta quam nam iste et ab maxime nisi cumque et expedita quod et dignissimos quis magni sed a omnis eos ut aliquid occaecati aspernatur quod similique vel consequatur voluptatem perferendis inventore est quae nihil asperiores magni quisquam quod dolore illo est est ut voluptatibus cum quibusdam adipisci minus ipsam occaecati tempora odit eum quia impedit inventore aut dolores sed eum sed optio ullam voluptatem repellat qui est dolorem eveniet omnis assumenda sint adipisci velit aut provident id nobis quidem rem et beatae ipsa qui voluptatem aut harum sunt ipsa nemo omnis qui officia distinctio enim eos voluptatem sequi autem at fugiat praesentium distinctio occaecati labore nobis et repellendus beatae in aut voluptatem eum quos soluta sed amet quo itaque et qui laboriosam quia architecto est odio perspiciatis nihil dolorum aut est enim iste modi illo dolore pariatur impedit qui fuga dolor laudantium est dolores sequi minima est quia fuga enim rem ut minima ea quia inventore omnis repudiandae corporis aut voluptatem sit vitae repudiandae sint nostrum explicabo quidem officia eum saepe non minus est et sequi magni officia mollitia tenetur quam asperiores porro praesenti