INSERT INTO `course_news` VALUES ('48', '6', 'Pariatur fugiat vero sed delectus.', 'Omnis et quidem ex corrupti est aut ipsa sit omnis eligendi voluptas dolor autem at iure eveniet aut optio blanditiis animi quia in est sit cum aliquid repudiandae natus error ea itaque minima ab molestias maiores a quia possimus ratione sapiente voluptatibus facere minus amet alias ut est id beatae et est animi doloribus maiores quasi fugit sit cumque nisi placeat asperiores nisi voluptas sequi omnis laudantium necessitatibus veritatis aperiam aliquid qui voluptatem est mollitia quibusdam laudantium fugiat nihil voluptas vel occaecati possimus harum error et hic et omnis quidem est rerum quia et assumenda exercitationem accusantium placeat laboriosam ipsa quo quod ut quia quasi vel mollitia minima et natus quis ipsa temporibus illum maiores dolorem sunt libero vero itaque autem possimus magni delectus voluptatibus ipsa reprehenderit perspiciatis debitis voluptates at quaerat et iste nostrum adipisci dolor magnam hic molestiae eos voluptates iusto deleniti earum voluptatem dolores sed porro nostrum deserunt eveniet in est qui soluta repellat laboriosam ex perspiciatis eos facilis voluptas quae rem perferendis omnis et officia voluptatem rem autem eum labore et eum facilis neque cum et tempore ea dolorem assumenda quis mollitia odio sequi libero voluptate et nostrum vel sit occaecati et possimus voluptatum ut beatae saepe cumque quo ipsum fugit perferendis et dolores provident animi eos quaerat doloribus sint odio non rerum vitae ipsum consequatur earum voluptatem earum eius cupiditate et ut eum iste error eum voluptatum et id sit sint libero sunt fuga tempora unde et et facilis distinctio rem delectus numquam voluptatem voluptates sed distinctio numquam nobis labore culpa quia esse inventore molestias dolore possimus est ea officiis deleniti rerum dolore consectetur quis sed repellendus autem provident delectus eos sunt et molestiae ut vero quia soluta hic tenetur iste molestiae corp