INSERT INTO `course_news` VALUES ('49', '1', 'Id eos cupiditate molestias.', 'Quo voluptatum similique incidunt cupiditate dolores voluptas ut repudiandae et deleniti ipsa dolorem placeat similique sequi fugit doloremque non sit qui enim at saepe voluptatem et ducimus similique minima minima voluptatem inventore quas ut ullam qui fugiat magnam ipsum qui ut eum vero sint asperiores fuga sit adipisci est temporibus molestiae sed eaque est illo ut rem nam sunt veritatis quia ut suscipit ad et tenetur aut sunt sapiente veniam doloribus facere dicta cumque maxime itaque veritatis sed iure repellat provident et minima voluptatem perferendis sapiente veniam facilis maxime ipsum non voluptatibus facere cumque cupiditate repellat deleniti ut et et distinctio possimus voluptatem ipsam quia nostrum eum quo nostrum id culpa illum animi distinctio libero est accusantium minima exercitationem natus voluptatem ad porro distinctio ducimus est temporibus veritatis dolores ratione nisi at consequatur reiciendis et ipsa recusandae ducimus accusamus commodi reprehenderit et et reprehenderit vel totam minima blanditiis facilis nostrum consequatur veniam est adipisci expedita culpa ab suscipit doloremque velit architecto asperiores tenetur sit harum repudiandae quaerat rerum recusandae et officiis consequatur nemo voluptas voluptatibus id omnis enim beatae quia eos omnis ullam in eos et pariatur eligendi inventore inventore minus eum nemo nulla est non sit doloremque quis tenetur doloremque sapiente assumenda deserunt nihil laborum animi in id fugit necessitatibus culpa ut dolorem accusamus dolorem vitae similique voluptatem doloremque nihil illo quia sint pariatur ut atque ea soluta quia excepturi fuga doloribus quo est illo necessitatibus mollitia cum dolorem praesentium ut est dicta autem soluta harum ea ut esse possimus modi nostrum atque aut dolor eligendi omnis laboriosam esse saepe cumque odit et eligendi iure magnam iusto aut quia recusandae officiis est est culpa saepe est vel o