INSERT INTO `course_news` VALUES ('50', '7', 'Odio dolor debitis voluptatibus quis accusamus cum.', 'Distinctio autem pariatur et quia voluptatem cum numquam aperiam rem doloremque impedit vero blanditiis neque voluptates natus rem quia molestiae est temporibus ut sed voluptatem velit labore quisquam voluptatem a qui adipisci provident iste aut molestiae commodi consectetur et aut culpa sapiente est nulla eum aperiam fugiat nesciunt est totam corrupti vitae odio occaecati error earum tempora inventore occaecati rem occaecati numquam quia tenetur itaque aut quisquam inventore autem et laboriosam voluptates iusto veritatis qui atque dolorum unde qui veritatis nemo omnis voluptas amet voluptatem ut ullam sed non optio eaque velit ipsam ea nisi a molestiae minus ut et doloribus dicta accusantium inventore ipsa ut voluptas voluptas perspiciatis quam dolorem esse maxime dolores aut quis dolores fugit perspiciatis repellendus voluptates optio excepturi facere sint eum autem consequatur corrupti sequi et quae iusto fugit sequi sapiente dolores enim quisquam eveniet consectetur beatae dolor quidem quia enim nihil at enim nam corrupti asperiores ea tempora tenetur magni dolores nemo laudantium vel magni fugiat accusamus ut expedita vel magnam eaque nobis temporibus corporis repellat dolorum ipsum ipsa eaque odio consequatur sed veniam cumque qui ipsam aut rem ipsa qui rem velit a ad molestias itaque minima et architecto quod sunt assumenda sed occaecati ratione explicabo laudantium doloremque possimus distinctio eum quibusdam eius officiis tempore ducimus officia fuga a qui qui odio quisquam veniam illum ea rerum aut quaerat possimus non id unde repudiandae ipsam iure error nihil iste ducimus facilis quidem impedit similique esse porro culpa quasi aut dolore et enim iusto error deleniti deserunt officia enim qui ipsum dolorum illum consectetur eligendi et saepe autem non quo quis quisquam rerum ipsa maiores animi voluptatibus iusto asperiores et est velit eligendi aliquam qui