INSERT INTO `course_news` VALUES ('51', '6', 'Tempora animi iure modi.', 'Et ut sit amet recusandae ut culpa consectetur placeat quasi vitae eius autem vel omnis et ut velit qui dolore eaque enim quia est eveniet debitis a rerum laborum minima doloribus itaque repudiandae at ut aut hic quidem est et cum quia velit modi harum necessitatibus quo voluptatibus iste vitae dolores quia reprehenderit modi molestias aut dolor illo maxime rerum provident at expedita iure nihil et dolor et eaque aut at maiores et dolor deserunt eos mollitia corrupti molestiae velit omnis aut voluptas vel ea dolor labore vel velit perspiciatis odit voluptas mollitia atque ad est expedita assumenda dolores sed nostrum nisi nostrum nobis quisquam non quaerat labore ea similique ea sed amet qui beatae rem eveniet quasi fuga eaque perferendis facere a corporis consequuntur ex quia aliquam nostrum atque consectetur sunt exercitationem exercitationem officiis eum est sed voluptatem dolorum commodi quam vitae dolore odio illum voluptatem voluptatem fugiat enim qui sed aut voluptatem id doloribus veniam unde ea minima tenetur ipsa dolor molestiae consequatur laudantium sapiente eum unde quam velit dolor enim et nihil et voluptatibus vel fugit odit hic eaque eum qui dolor repellat blanditiis nihil non et cupiditate recusandae harum veniam earum dolorem quia neque quia culpa magni enim exercitationem ut quaerat adipisci praesentium in voluptatum et nisi laudantium aut eos possimus voluptates assumenda dolor cum ullam sit aliquid dolore cum quod non sunt debitis eius inventore perferendis vitae ut perspiciatis aut quis qui officiis et unde aspernatur dicta vitae ut et est quidem nihil repellendus odit autem quo aut quam minus in id enim rerum est impedit rerum.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('52', '2', 'Unde et sed dolores consequatur ullam.', 'Molestiae est est unde eius quasi quo in iste fuga nam voluptatem ea veniam aut natus modi velit ea repudiandae animi laudantium quos deserunt inventore soluta quaerat eaque rerum minus maxime et sed sequi vel maxime officiis sed dolores voluptatem earum recusandae eius quidem et fugit amet accusamus natus doloribus placeat quaerat minima est qui est eius aut dolor vel repellat dolorum vero fuga qui autem debitis et deserunt veritatis beatae et culpa commodi suscipit repellendus dignissimos quod veniam sit sed qui ex consequatur qui illum fugit voluptatem quas autem aut non praesentium atque veniam sed pariatur tenetur perspiciatis nihil quas rerum molestiae et aut vel et dolor cumque dolorum non sint laboriosam eos enim ullam consequatur voluptates inventore dignissimos voluptatem beatae autem voluptate dignissimos et laudantium occaecati hic praesentium excepturi ut voluptate quas earum dolor esse natus non pariatur perspiciatis nihil unde qui nostrum nostrum corrupti placeat inventore aliquam enim voluptatem eum et maiores qui in quos animi eius eligendi sint rem aut sunt ducimus recusandae ullam ex dolorem asperiores accusamus inventore perferendis rerum quia voluptatem ipsum distinctio eum molestiae fugit possimus rerum repudiandae quidem inventore quod explicabo mollitia nobis reiciendis in aliquid labore et saepe omnis molestiae id suscipit magni qui reiciendis minus eligendi molestiae quo delectus praesentium molestiae asperiores sint qui aspernatur repellat qui nemo aut libero ipsum cumque corrupti consequatur aspernatur hic officia qui libero reiciendis officia autem deserunt dolores distinctio maiores deleniti totam sed eum animi id nihil aut dicta magnam autem dolores sed maxime repellat itaque neque ut sint odio nesciunt ducimus sed non culpa quia eveniet nisi sed itaque repellat id.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('53', '9', 'Eveniet sapiente recusandae aspernatur distinctio molestias omnis in.', 'Facere enim praesentium saepe reprehenderit ipsum ab quia et ut qui dolor eum vero ad facere quas dolorum sapiente maxime exercitationem voluptatem et quia repudiandae in aut dignissimos alias et provident corporis quia delectus delectus ut sed qui aut eum ea tempora debitis voluptatem delectus iure fugit eos error blanditiis placeat dolor atque quo natus voluptatem est rerum ab esse magni perspiciatis dolorem laboriosam non temporibus ut quo dolores perferendis aliquid unde sunt ullam aut commodi sit harum et et ut autem praesentium et sed consectetur et eaque magnam vitae sequi minima mollitia quo exercitationem itaque quidem non quibusdam numquam quos rerum qui et dignissimos eveniet eveniet illum quo officia eaque commodi libero illum accusamus consequatur temporibus quibusdam repudiandae commodi explicabo accusamus aut ex exercitationem voluptatum consequatur et repellat molestiae odit mollitia aut id dolor placeat ea qui omnis debitis officiis vel aut debitis excepturi aut perferendis officiis delectus voluptas sit qui velit non reprehenderit nemo ducimus autem et enim doloribus magni ad in quod natus dolores est explicabo molestiae quibusdam recusandae ipsa optio rerum et recusandae nemo voluptatem ratione aspernatur beatae nisi delectus dolor a ut quas ullam excepturi vel nemo doloremque voluptates placeat ut.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('54', '5', 'Officiis dignissimos perferendis fugiat sint dicta beatae.', 'Qui dignissimos omnis velit blanditiis nulla amet ducimus eligendi est similique dignissimos non assumenda exercitationem harum rerum consequuntur aut et aspernatur autem non voluptate quod numquam saepe cum possimus qui molestiae tempore mollitia ut aspernatur possimus aut dolor officia facere accusantium autem et consequuntur nam fugiat consequatur sunt distinctio molestiae consectetur deserunt totam sit illo omnis eos distinctio placeat sequi est excepturi non quaerat ut fugiat est nihil placeat dicta ipsum fugiat rerum tempora et in voluptatum molestias dignissimos qui asperiores perferendis quia autem et aut pariatur dolorem impedit officiis rem nobis aut voluptatum veniam libero perspiciatis nihil repellat autem facere porro et consectetur repellat dicta ratione perferendis reprehenderit sed ea iure iste omnis vitae fugit enim dolores qui corrupti accusamus rem et incidunt id adipisci voluptate omnis sed eligendi et natus repellendus nihil rerum quia voluptatem eum quia voluptatem maxime eaque amet explicabo dolor voluptatum et autem iure tempora officia sed commodi quia eveniet enim voluptatum ducimus explicabo eos minima reprehenderit quis aut officiis sit molestiae voluptate aspernatur illum hic repudiandae ex corrupti natus doloremque qui rerum incidunt ratione tempora molestiae voluptas perspiciatis qui reiciendis numquam et nisi vel aliquam et ullam expedita laborum nemo tempora id in labore cupiditate sit ut ut aspernatur distinctio error itaque et suscipit consequatur repellat id explicabo totam provident similique voluptas nostrum et voluptatem eligendi corrupti officia id et dolorem illum ut vel quibusdam earum dolorem fugit beatae asperiores delectus iure veniam beatae nobis est aut numquam ad cumque laborum rerum quia nulla illum aspernatur architecto mollitia praesentium qui omnis molestiae nam atque assumenda veniam quia et commodi voluptat