INSERT INTO `course_news` VALUES ('55', '8', 'Perspiciatis vel et et facilis praesentium debitis aperiam eum.', 'Harum mollitia dolorem possimus eos eaque ut ipsam ut ut fugiat non ullam consequatur saepe blanditiis voluptas et sed praesentium fuga ipsum maiores est nemo commodi quibusdam est sint minus minima asperiores explicabo illum qui est et iure autem sit unde porro voluptatem praesentium enim voluptatem est inventore quia vel fugiat sed sed velit qui laborum necessitatibus at est voluptas molestias sequi rerum distinctio nulla cumque laborum in odit voluptatem laborum et et aperiam et veritatis eos voluptates consequatur explicabo nemo totam hic a accusantium est aut eaque aut sunt quis in qui accusantium molestiae et alias vel enim molestiae rerum quos doloremque laudantium velit modi consequatur consequatur ut quis facilis quam laboriosam dolores qui consequatur voluptates est consequatur harum sit beatae aut dolor quasi sit quod aut temporibus quisquam aliquid saepe voluptatem adipisci dolor deleniti recusandae quaerat voluptatem repellendus quasi eaque maiores illo voluptas consequatur ut quo quia consequatur dolor quis velit asperiores ut ut sed fugiat et tenetur occaecati quasi ut laborum quo repellat tenetur provident id repellat quia quisquam voluptatum et vel impedit nihil voluptas et et quia adipisci eligendi sequi voluptatem necessitatibus id est consectetur numquam in et provident reiciendis beatae voluptatem atque accusantium ut accusantium officiis quis dolorem ipsum ut ipsam voluptate harum eius ab exercitationem modi ut eos repellendus laboriosam et officia doloribus possimus delectus eius aliquam in dolor ipsum dignissimos unde nobis voluptatem qui libero odit modi magni ab iure autem numquam sit soluta ad ut quae reiciendis et assumenda et earum nam culpa maiores commodi velit harum sequi omnis perferendis qui quasi quaerat quia earum odit animi aut perferendis quaerat impedit nobis architecto ea et accusantium perferendis molestiae officii