INSERT INTO `course_news` VALUES ('56', '5', 'Amet ut dolorem blanditiis voluptas quaerat eaque.', 'Nihil est tenetur sit at fuga ut omnis esse dolorem aut repudiandae enim odit voluptatum enim molestiae esse aliquid numquam ut voluptatibus quam doloremque libero impedit ab iusto placeat enim harum minima atque qui aut cum omnis accusamus asperiores aut non consequuntur modi officia dolores dolor ut qui repellat necessitatibus ut deleniti et reprehenderit molestiae porro nulla et vel corrupti molestiae ab labore sit et quia dolorem eum sed autem harum tempora voluptatem dignissimos ea et consequuntur debitis enim nulla sed perspiciatis eum illum aut quae consequatur et ullam in dolorum repudiandae quia facilis dolor vitae saepe praesentium est quam temporibus tempora sapiente labore unde voluptatem quaerat tempore sint ipsam quod soluta consequatur est dolorum dolore dolor tempore possimus blanditiis culpa possimus sunt ut laborum asperiores qui sunt nulla et quia dolorem tempora repudiandae atque voluptate architecto consectetur nihil eveniet sint facilis modi sunt ut est ullam veritatis id atque est maxime odio non quas laudantium et consectetur tenetur magni ab vel et cupiditate blanditiis odio similique neque qui vero laboriosam non consectetur voluptate et consectetur vero doloribus non tempora eligendi sed nihil voluptas natus ut ea qui maiores quaerat aut repudiandae a tempore et alias cupiditate harum quos harum ut quia est dolores asperiores ea aut perspiciatis voluptas voluptates mollitia cupiditate voluptas sequi qui recusandae est nemo soluta eum nesciunt aut quaerat natus perferendis explicabo qui placeat ab odio odio aliquam cum recusandae hic non animi aut et magnam repellat ut soluta ipsam ut doloremque non facilis maiores vitae beatae possimus voluptas doloremque mollitia aut officia exercitationem autem qui quasi quisquam qui reprehenderit voluptas adipisci porro qui consectetur dolorem quia provident non sequi eius amet quaerat est vitae pariatur doloribus quasi dolorum facilis quas adipisci maiores et ea impedit consequatur modi architecto est qui iure dicta nulla omnis non doloribus et et et voluptas animi sapiente totam ratione minima ratione et minima quisquam doloremque quia assumenda pariatur quo sed quam qui et velit veniam iusto vitae voluptas velit sed quia odit iure praesentium numquam et perspiciatis enim voluptatibus quas est unde impedit in deleniti sapiente ipsa eius placeat voluptas harum ipsa est aspernatur qui ipsa vero non reprehenderit eum voluptatem iusto voluptates molestiae quos quo ut voluptatem rerum nesciunt earum consequatur consequatur qui animi a quis itaque accusantium consequatur error eum perferendis aperiam veritatis ad porro est et dolores blanditiis numquam ea consequatur aut sed cum dolorem hic debitis quo et et.', '1', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('57', '7', 'Molestiae doloremque in autem saepe dolor quisquam est.', 'Eveniet modi suscipit repellat suscipit sed quibusdam ad ut optio qui omnis quia et aut qui laudantium quae asperiores quia fugit voluptas corporis fugiat doloremque ut id omnis maiores itaque est quia quos omnis doloremque quasi fugiat fugit ipsam reprehenderit est et nam et molestiae voluptas ex optio adipisci minus delectus repudiandae voluptate at reiciendis quae minus quibusdam quia eos porro voluptas odit voluptate error perferendis recusandae modi debitis sint quo atque suscipit facilis sit hic eos similique nesciunt perspiciatis itaque dolores perspiciatis porro eum voluptates placeat ipsum unde eaque fuga dolor recusandae harum ex fugit quia hic itaque in harum ipsum earum incidunt est est omnis deleniti ipsam architecto repudiandae ab voluptas exercitationem expedita quae doloribus adipisci harum necessitatibus illum et id provident non laudantium labore ut labore modi corrupti voluptatum excepturi consequatur vel rerum occaecati asperiores nulla sapiente fugiat repellendus dolores eligendi sunt minus ea illum fugiat dolor et debitis enim dolor aut porro delectus aspernatur tempore odit eum et amet dolorum saepe nostrum reprehenderit ut iusto culpa autem porro quo tempora sint aliquam accusantium eum veritatis quia exercitationem eum molestiae est corrupti deserunt at quis quia unde nam quo cupiditate qui similique numquam architecto ut est doloribus sunt laboriosam deserunt laborum voluptatem maxime est dolores iure ea ipsum illum autem ut excepturi dignissimos ipsum ad officiis voluptatem amet vitae non modi et est et veritatis ratione id minus consequatur ut optio adipisci dolores a impedit vitae eum cum sunt accusamus omnis rem rerum blanditiis dolorem sequi reprehenderit occaecati dignissimos qui est accusantium non dolor ducimus neque libero sunt est recusandae expedita inventore repellendus esse maiores.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('58', '4', 'Quod architecto quam cum voluptate atque esse.', 'Deserunt esse id quia sit quis qui consectetur esse nostrum dolores quis deleniti ad unde rerum incidunt quae officiis aliquid consectetur et praesentium quo sit inventore nemo atque aut repellendus exercitationem vitae laudantium ea voluptatibus quidem eligendi velit perferendis sit earum et placeat dolorem assumenda quaerat vel ut provident magnam modi harum eligendi voluptas maxime officia modi dolorem eius voluptas cupiditate quod earum non magni debitis voluptas et suscipit saepe voluptatem magni dolore et et eum iusto ut assumenda ex voluptas facere sit illum tempora atque dolore incidunt rerum enim minima omnis magni natus aliquam omnis error nihil voluptate quas ea voluptatem cumque unde veniam ex illum illo occaecati est asperiores et praesentium voluptas quia illum earum velit et in quis voluptas architecto perspiciatis cupiditate tenetur voluptatibus cupiditate velit et provident voluptas voluptatem repellendus aspernatur quia tenetur quaerat libero eligendi amet non est magni blanditiis doloremque nisi error consequatur autem ab nisi et placeat non repellat molestiae ipsam vitae quae et sit molestiae inventore ullam distinctio dolorem est distinctio nisi molestias dicta iusto officia quidem officiis ullam nam nemo iure occaecati non enim rerum qui velit optio at tempora repellat illum distinctio ex sapiente natus quam aliquam inventore vitae accusamus culpa harum nihil ea eos perferendis inventore repellat et et itaque ducimus illum veniam ad dicta eius velit et eius blanditiis qui fugit architecto quis veritatis rerum laudantium vero ratione sint non velit perferendis ea expedita hic quia voluptas et quibusdam tempora deserunt velit magni officia et minus veniam et dolor debitis itaque quasi doloribus et voluptatem voluptatem voluptas adipisci eligendi error vel nulla rerum omnis molestiae dignissimos et fugit vel repellat iste blanditiis consequatur incidunt