INSERT INTO `course_news` VALUES ('59', '7', 'Iste dolor ducimus commodi corporis cum qui quia.', 'Fuga dolor ducimus ipsum similique deleniti excepturi nesciunt explicabo eligendi rem et totam sit amet eaque cupiditate velit dolorum blanditiis a aut sunt sint mollitia sequi autem asperiores et quod consequatur eligendi perspiciatis quod odit eos ex alias eum molestias sit minima porro alias consequuntur voluptates delectus et est ipsam saepe voluptas fugit dolorem sint qui cupiditate voluptas at mollitia ab aut beatae reprehenderit facere rerum sit neque vitae voluptatem nisi eos qui hic veniam perferendis at optio et voluptas asperiores voluptatem et minima vel illum nisi deleniti sunt non tenetur veritatis voluptatem quo neque pariatur facilis velit vero qui eum totam et sed aut similique sit molestiae quo dolores eos nulla sed repellendus labore quibusdam qui aspernatur temporibus rerum enim ea ratione ad quibusdam ullam ut ipsa ea totam autem ipsum nisi esse non perferendis dignissimos et dicta non explicabo reiciendis temporibus et aliquid quaerat quo molestiae dolore et est architecto aut sunt omnis impedit sed cumque voluptate hic veritatis sequi vel reprehenderit et eaque nobis ipsa maxime molestias dolorum tempore suscipit porro porro dolores facere repellendus modi sed iure delectus et magnam temporibus sequi ut excepturi eum odit a placeat illum rerum aliquid sed blanditiis excepturi magni officia sit autem fuga veniam qui in sunt dolores consequatur pariatur occaecati quis quo et accusantium eos voluptatem maiores ratione dolor exercitationem modi accusantium alias labore perspiciatis quia temporibus distinctio quo magni assumenda quo deleniti blanditiis alias qui numquam et quia qui vel cupiditate neque reprehenderit sequi cumque sed alias sed enim omnis qui possimus natus qui quidem provident dolor aut et ea dignissimos dolor eos odio fugiat velit placeat voluptatem alias repudiandae consequatur porro laudantium libero praesentium iste sint voluptate delectus est labore placeat accusantium quod esse non dolores blanditiis non quibusdam quis nihil praesentium est placeat ut omnis odio rem delectus iste dolorum illum cum explicabo aut perspiciatis et ea et dolor dignissimos repellat illum nisi ipsam cum ipsa rem expedita eligendi eos aut.', '1', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('60', '1', 'Aut iusto quia sint voluptatem aut.', 'Error dignissimos dolore magnam qui rem quam sequi culpa mollitia velit et possimus doloribus aut itaque accusamus qui et architecto enim aspernatur mollitia quas laboriosam non omnis libero aut quia vero repudiandae enim in qui repellendus omnis voluptates corporis molestias non quo ea expedita voluptate voluptas velit ea unde facere explicabo perspiciatis modi repudiandae fugiat voluptatibus nam quidem dolorum magnam quaerat officiis eligendi placeat praesentium est sed excepturi illo repellendus qui nobis voluptatibus distinctio reprehenderit dolorem magnam ipsam ea quia dolores exercitationem atque esse iste voluptatibus ut doloribus voluptatem similique consectetur et inventore quasi neque ut non eum sed harum est pariatur consequatur ut recusandae at ea sapiente hic ipsum adipisci aut qui velit vero voluptatem unde modi vero molestiae illum natus debitis inventore fugit autem vel architecto tempora dolor itaque commodi repellat aliquid quis rerum asperiores in quis voluptatibus aliquid rem deserunt alias facere reprehenderit quas et dolorem doloremque sit sint quasi aut asperiores modi voluptatum accusamus molestiae inventore ut quae ut non praesentium unde at facere dolor repellat harum quibusdam eum voluptatibus culpa totam asperiores voluptas voluptas harum maxime nulla et ea quia quas cupiditate odio non veniam ad aliquam vel occaecati et debitis.', '1', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('61', '3', 'Similique minus reprehenderit ut quis molestias.', 'Id ex ea et hic enim eaque odit magnam est accusantium necessitatibus suscipit similique saepe sequi voluptas sed sapiente aut libero culpa est quos voluptatem corrupti est suscipit voluptas commodi aspernatur ullam id consequuntur harum ut nulla unde laborum perferendis eum qui voluptatibus vel est maxime aut necessitatibus minima consequatur architecto voluptatibus sunt autem illum omnis est vitae expedita accusantium fugiat iste eveniet porro aspernatur ad aut minima enim quae non eligendi quisquam harum consequatur aut et praesentium at debitis voluptatem dolorem molestias possimus soluta ut sit aut sapiente laboriosam voluptas eaque qui omnis facere officiis fugit eum molestiae vel nisi labore iusto eligendi iure maxime architecto in fuga velit voluptatibus odit repellendus vel voluptate dolorum reiciendis inventore animi cumque repellendus quia voluptatem modi laboriosam quas itaque asperiores dolorem enim et autem voluptatem cupiditate non occaecati autem dolores sed illo sit molestias et id beatae qui sint quo quia nobis deleniti sit quo totam delectus porro enim vero illum ipsa aut minus tenetur in dolores esse pariatur sed cupiditate iure sed consequatur omnis mollitia omnis minus perspiciatis quisquam voluptas dolor dolorum necessitatibus eligendi soluta ratione molestias aut vel nobis mollitia voluptatem vel unde quaerat ut voluptas aut soluta voluptates error inventore eum beatae quis sunt illum inventore et facilis enim sapiente aut omnis voluptatem quia ad voluptatem dolores quae voluptate consequatur perferendis ab quia dignissimos saepe.', '1', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('62', '10', 'Laboriosam rerum nihil rerum maiores dicta nihil.', 'Modi dicta dolorem libero ratione excepturi vitae quae ut commodi consequuntur consequatur et consequatur consequatur dolores quod hic a recusandae enim inventore sint qui enim et praesentium sed sit quis libero repudiandae recusandae natus consectetur et cupiditate consequatur blanditiis voluptatem vel recusandae autem enim ipsam laboriosam cum nesciunt non aperiam eaque omnis dolores nisi consequatur ut voluptatem et quam non reprehenderit laborum voluptatem ut doloremque officia natus mollitia sit nulla aut quia magni eligendi dolor esse repellendus vero ducimus quo aut ipsa similique accusamus id sed voluptatibus eaque enim in delectus ex incidunt aperiam tempore rerum itaque quis pariatur quia ratione dolor id quas quo expedita repudiandae deleniti facere consectetur pariatur in quos hic nostrum cupiditate dolore fugiat dolorem blanditiis fugit provident laudantium reprehenderit ipsum voluptas ut vitae quibusdam enim veniam consectetur perspiciatis eos est officiis accusantium tenetur ipsam quisquam cupiditate repellendus est error commodi delectus quia ad inventore placeat recusandae harum id rerum distinctio qui sunt quo ipsam dolore ullam porro illum veniam doloribus quod laudantium natus perspiciatis laboriosam iusto sequi minus fugiat sunt eligendi quia quia amet consequatur ipsa maxime qui mollitia quasi sed cum dignissimos odit necessitatibus dicta aut libero commodi est ipsa cum enim distinctio et impedit corrupti quidem beatae eos possimus modi ex iste voluptate sunt dolorum iusto officia.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('63', '1', 'Aperiam eaque debitis accusamus.', 'Tenetur alias velit omnis veritatis expedita tempore accusamus dolorem quo qui velit aspernatur officia quia maxime qui enim provident commodi aut reiciendis quaerat molestias minus vitae consequuntur minus facere ut sunt id perferendis vel ipsam est est officiis labore et est adipisci enim ex nobis nesciunt quia a placeat eum aliquam quo aliquam accusantium tempora omnis optio aut laboriosam incidunt tempora porro ut consequatur voluptatum corporis cupiditate quis itaque praesentium magnam voluptas excepturi fuga iure natus quod eius similique dolores saepe quae ut necessitatibus quibusdam dolorem qui vero qui deserunt veniam possimus accusantium neque rem magnam totam qui dolorem et quis labore facilis laboriosam corrupti et et officiis natus laborum expedita quia dolorem est consequatur ut molestiae expedita vel tenetur illo similique repellat accusamus quam hic tenetur et neque dicta eos ipsam laborum consequuntur quos nemo alias consequatur dicta sed rem est magnam quam aut quaerat repellendus voluptatibus excepturi nobis non nobis aut quibusdam nisi magnam neque ut voluptas optio distinctio in facilis in ut et sapiente consequuntur ullam qui et id voluptatum ut eum non eos earum enim praesentium et non assumenda ducimus et veniam quod occaecati optio maiores ipsum hic rerum id quia omnis exercitationem illum reiciendis quia et ea soluta aut non consequuntur dignissimos minus accusantium et officia aperiam dolorum deleniti quo sint necessitatibus nam aut accusantium nostrum natus reiciendis nam voluptate voluptatem quam inventore nemo at reprehenderit est ullam tenetur exercitationem aut ipsum consequatur id eaque porro impedit quo voluptate voluptatem facere molestiae voluptatem rem est ducimus quis necessitatibus exercitationem tenetur adipisci nam iure mollitia vel aliquam sunt expedita ex accusamus sit odit iure vel consequatur assumenda dolor est dolorem consequatur illum iste omnis quod magni autem adipisci at eligendi numquam et earum unde maxime sapiente autem et quas occaecati eum aut et quibusdam id dignissimos eligendi ullam perferendis qui nulla assumenda reprehenderit repellendus quo nostrum omnis fugit dolorem sint eligendi consequatur atque reprehenderit et eos laudantium doloribus rem quis aut occaecati eum nobis cupiditate nobis sapiente modi quia velit optio officiis occaecati vero illum consequatur qui nam id modi fugiat illum repellendus reprehenderit in vel assumenda neque non molestias nisi tenetur dolore sed.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('64', '10', 'Molestias vitae tenetur et molestiae consequatur.', 'Eum excepturi harum nemo libero vel eum ullam rerum voluptatem non quod illum quos id recusandae dolorum modi facere esse nemo totam ea rerum debitis quasi reprehenderit aut vel similique qui sint tempore atque illum est laboriosam sed odit iure nesciunt sunt quo tempore quaerat pariatur quis voluptas nemo molestiae qui est vero quasi placeat minima id velit officiis est asperiores voluptatum dolore et provident occaecati in ipsa est quod aut unde et dolores esse aut voluptate esse consequatur doloribus voluptatum ea id nihil consequatur laboriosam illum magni nostrum praesentium non ut repudiandae dolorum adipisci cum nemo modi ab perspiciatis molestiae quam explicabo qui rerum ut dicta quasi voluptatem dicta amet et architecto et dolorem itaque et aspernatur dolor eos hic et earum suscipit omnis numquam quia nam molestias corporis ea et beatae ad dolore quidem debitis ad autem quidem cumque sint itaque quas fugit qui voluptates aut laudantium dicta iure ut voluptatibus officiis laboriosam rem sed dolorem libero accusantium architecto aut ut non dicta quibusdam laudantium voluptate eaque voluptas temporibus vitae facilis corrupti qui et officiis sapiente perferendis officiis laudantium mollitia vel exercitationem fuga aliquam est maiores animi voluptatem nulla eaque et nesciunt atque saepe quia qui quia praesentium odit nesciunt mollitia ipsa nemo excepturi ut rerum laborum est velit corporis necessitatibus nam quia laborum aut nemo quo ea aut corporis iure voluptatibus in illum ducimus saepe ipsa est voluptatum praesentium nobis maiores voluptatem in distinctio ut temporibus quod et dicta fuga illum rem repellendus earum.', '0', '2017-05-02 22:58:45', '2017-05-02 22:58:45');
INSERT INTO `course_news` VALUES ('65', '9', 'Ad nam excepturi aliquid laborum itaque qui facere magnam.', 'In est aut suscipit sed doloremque in molestias ratione in nihil ex laudantium libero tempore vero consectetur omnis eaque debitis corrupti et omnis cupiditate ut rerum laboriosam facilis est quis a quasi dolore nulla officiis fugiat magnam iste earum pariatur et consequatur est libero harum in voluptatem nihil labore omnis accusamus officiis non nulla et cumque fugit illum amet voluptas sit qui aut non nihil rem quidem illum voluptas nisi exercitationem ut sit cumque et alias est iusto nihil iste ut neque dolores quis omnis voluptatem exercitationem aut sint ad praesentium excepturi maxime asperiores exercitationem est qui voluptatem consequatur beatae quasi esse omnis aperiam quae eum est fugiat enim quisquam corporis perferendis doloribus possimus neque assumenda praesentium laboriosam enim quis vero blanditiis similique est eos excepturi id praesentium velit qui qui rerum provident et perspiciatis labore aut provident eum quas perspiciatis amet rerum vitae id repudiandae sed rem in sint et ut numquam esse dolorem natus neque esse iusto natus minus reiciendis unde dolor aspernatur adipisci voluptas eligendi perferendis temporibus dolores esse amet voluptas iure veritatis ut vel incidunt impedit dignissimos quae beatae ullam voluptatem ad dolore fugit voluptate consectetur qui et molestiae odit rerum amet a doloribus aut sed modi expedita ut eaque veniam repudiandae libero rem quaerat reprehenderit sit voluptatem dignissimos ea porro ad ut aut cumque id voluptatem doloremque maxime eligendi voluptatem aut nihil molestiae cumque velit aut amet blanditiis autem quia dolor eos aut consequuntur quas ex molestiae dolor pariatur omnis est commodi unde est adipisci eligendi explicabo culpa.', '1', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('66', '1', 'Mollitia ut aut est ducimus.', 'Velit similique ut quos culpa iste sunt eos rerum et rerum modi quidem ullam eveniet ut veniam sequi ut et qui voluptate aut eaque blanditiis eaque aut et cumque sint quidem eos optio quasi repellendus ea distinctio maxime accusamus sequi nisi enim itaque culpa voluptatem natus ut quibusdam aliquam quam eos qui aperiam aut deleniti porro ratione omnis molestiae corporis minima quia totam est quia velit non quaerat sed tempore iusto sed et earum repellendus eligendi aut laudantium fugiat sit in quia qui quibusdam voluptas mollitia corporis ducimus et facilis praesentium eos quaerat velit blanditiis ipsa eos consequatur sapiente ut accusantium quaerat cum aliquid accusantium odit libero explicabo exercitationem quibusdam placeat quasi dolorum possimus rerum animi aut expedita exercitationem eaque odit omnis atque cumque aut impedit velit ut eaque iusto voluptatibus modi quod quod atque qui ex aut eaque eveniet id voluptatem ad in inventore vel alias voluptatem sed at omnis aut consequatur velit sed itaque delectus quibusdam ratione culpa et architecto vel vero ut consequatur et architecto occaecati quisquam non repellendus et ullam qui sunt dolores velit aut totam magni veniam magnam dolores id quibusdam voluptate qui excepturi numquam quia laudantium et distinctio doloremque quia voluptas ea provident ducimus animi vitae labore voluptates quia velit sit assumenda iste qui dicta vitae ratione porro ducimus sunt quia architecto error veniam minima aut qui harum deserunt non consequuntur laboriosam minima eos facere iure ipsa laudantium repellat ut delectus asperiores ducimus adipisci repudiandae nihil sunt ea qui pariatur tempora et qui quis similique accusantium et id error molestias corporis qui mollitia laborum neque dolores qui voluptates et molestiae aspernatur cum temporibus veniam eum rerum fuga vero velit qui quibusdam commodi laudantium dolor sed quo qui quis nemo et doloribus deleniti dolorem qui aperiam et ea quia quo ipsum accusantium est ut rerum officiis ipsa ipsam necessitatibus id cupiditate modi laboriosam perferendis quaerat est harum quas voluptas nulla et ab blanditiis sunt temporibus dolorum ut neque et sed voluptas laudantium impedit perferendis facilis aut quia cumque aut voluptatibus debitis repellat sit nesciunt vel qui vel animi enim provident non et vel distinctio quasi quasi nobis aperiam quos delectus deserunt quasi a enim in quae eum ipsam dolores cupiditate voluptatem ab expedita maxime perspiciatis laboriosam nihil illum labore nam sit ratione necessitatibus dolorem repudiandae ea cum dolor accusamus laborum temporibus laudantium natus dolores veniam totam est aut cupiditate qui sed aspernatur repudiandae aut ex qui quae delectus molestiae ea recusandae nemo officia temporibus itaque labore quia modi debitis ut temporibus in consectetur fuga et quam.', '1', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('67', '2', 'Possimus non aut ut at ut.', 'Quam ex ut quia ut tempora similique quibusdam autem non provident expedita mollitia quia odit tempora alias tenetur officia ut perspiciatis et sint excepturi velit cumque assumenda aut repellendus id autem quo nihil ut aut vero iure quis similique quae voluptates laboriosam ratione corrupti aut culpa eos et maiores delectus dolore fugit et explicabo saepe laudantium vel numquam qui omnis nemo doloremque libero iure vitae repellendus possimus aut laborum adipisci laborum aut et quam tenetur sit quia suscipit quam iusto excepturi saepe ut vero quisquam sit qui beatae quo itaque accusamus inventore et autem consectetur ea sunt quia aliquam tempore architecto consequatur dolor facilis animi tenetur distinctio voluptatum veniam sit voluptas pariatur molestias velit voluptate quia distinctio voluptatem eveniet eligendi aut ea in ipsum qui perferendis quam magni inventore sit omnis ut mollitia rerum id nihil eum harum aut provident sit quisquam in ut quo in corporis error qui est dignissimos et necessitatibus expedita aperiam inventore nisi ea alias excepturi hic tenetur odit officia cum deserunt minus voluptas tempore rerum ad est beatae quia aperiam iure provident quidem magnam fugit dolores in quis tempore dolorum ut esse omnis accusamus consequatur voluptate consequatur dicta modi odit ea nesciunt ut possimus quaerat et facilis nesciunt qui magni recusandae ut est sit et officia.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('68', '1', 'Aut ut sed odit voluptas.', 'Voluptates voluptatem totam repellat voluptate cupiditate occaecati non ut impedit et dolor et nostrum quisquam aspernatur et eius earum recusandae labore est aperiam nihil doloribus itaque repellat ut quia nisi cum vel in inventore perspiciatis et ducimus impedit ut vel est voluptas eum aspernatur modi qui repellendus deleniti nisi dolores est ut qui aspernatur quisquam at quae non temporibus vitae sequi quo deleniti reiciendis nemo sed labore eum dolor doloremque itaque et et dolorum sunt enim explicabo est ipsum cum aspernatur ipsam impedit hic est commodi dolores perferendis et iure velit fuga esse omnis vero cumque repellat molestiae in sit voluptates cumque velit magnam amet assumenda explicabo est repellat nihil animi dolorem provident eveniet ex est ut doloribus ut aut quaerat quisquam voluptatem ea aut est sed porro sunt sit ea expedita dolores sed quae eum omnis natus fugiat laudantium ut iure eaque nemo autem corrupti tenetur cumque voluptates cumque eos consequatur officia esse mollitia suscipit aut consequuntur corrupti doloribus quam exercitationem placeat non et optio temporibus non minus itaque voluptas voluptas quam temporibus recusandae exercitationem fuga ratione aspernatur ea possimus vel aliquid doloribus aspernatur qui occaecati vero autem necessitatibus et dolore aut eveniet aut eveniet minima quo aspernatur magnam laudantium maxime commodi ducimus provident aut eligendi non nihil et nulla enim quo aut quisquam a ut debitis quo quia nihil rem sapiente quaerat quisquam atque quis vel nam iusto beatae molestias et blanditiis molestiae fugit repellendus iure ut voluptatum qui asperiores saepe dolorem porro incidunt accusamus doloremque fugiat voluptate consequatur qui temporibus distinctio molestias et et voluptas dolorem ab nihil aut consectetur numquam asperiores aut et est error sapiente dicta ea hic debitis aspernatur possimus nihil voluptas reprehenderit animi qui sol