INSERT INTO `course_news` VALUES ('69', '7', 'Occaecati id alias accusamus nihil facere quo laudantium.', 'Nisi dolore atque vitae consequatur dolorem et rerum ea ut odit officiis ut autem veniam nobis non qui quia praesentium optio error quia veritatis alias placeat aut praesentium est repellendus et natus dignissimos doloribus molestias consectetur labore quidem voluptas reiciendis qui qui est quia velit quis assumenda blanditiis eum fugit quos ut et ab eveniet voluptatum sed dolor nostrum porro tempore veritatis iure aut illum laboriosam ut occaecati tempore ea placeat voluptatem ad doloremque iste rerum quia dolorum velit ut voluptates pariatur iusto excepturi aut ipsa accusamus eos neque neque inventore eos aliquid quia ducimus iste porro repellendus iste impedit aperiam adipisci sed culpa quia rem voluptate accusamus aut consequuntur quaerat distinctio quo consequatur exercitationem quo sit molestias voluptatem est accusamus minima vel est consequatur dolore eum beatae explicabo aut ipsum sed impedit voluptatem recusandae numquam quae similique consequatur qui id et aliquid sed recusandae sequi totam voluptatem excepturi ut dolorum sit accusantium enim et quis molestiae tempore et est distinctio sunt non quas et expedita et omnis omnis explicabo porro vero ad quasi corporis aut rerum non quos velit fugiat facere iusto quia impedit perspiciatis velit qui est sequi adipisci blanditiis qui voluptatum suscipit explicabo voluptas quia et architecto nam cumque ipsum exercitationem quas eum harum consequatur perferendis velit voluptas maiores quas sapiente sit neque voluptas eum aut explicabo repellat suscipit maiores ut blanditiis odit quia aut consequatur saepe ex vel laborum temporibus modi dolores at quaerat quia quibusdam voluptatem eum aperiam id.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('70', '6', 'Reprehenderit sequi minima aut doloremque iusto.', 'Ut quis omnis aut quo minima non vero unde incidunt est blanditiis sequi dolor aliquam labore laborum quasi rerum explicabo a sunt velit optio ducimus sit aspernatur possimus id aut enim incidunt ratione beatae impedit quo ab ex soluta error in et sint repellat dignissimos iusto porro soluta excepturi rem recusandae ut voluptas et est sunt enim praesentium qui repudiandae est iure doloribus quis asperiores consequatur qui cupiditate officia hic aliquam quas sapiente doloremque voluptatem suscipit sunt qui eum sunt asperiores at similique sunt incidunt odio ullam deleniti quaerat quia incidunt dolorum nisi et sint ducimus quia aut dicta qui eveniet ipsa quo enim voluptatem rerum nobis consequatur a voluptas tempora temporibus explicabo fugiat aut perspiciatis enim cupiditate aut deleniti omnis mollitia rerum rerum aut et eum voluptates accusantium quia ea esse cum sunt libero aut molestiae qui ut dolore eum quis recusandae aut sit accusamus consequuntur ipsa eos et ut corporis in assumenda accusantium non pariatur qui quo eos voluptates est dolorem hic omnis molestiae sequi et odio quidem animi totam occaecati dicta consectetur et eaque quisquam est voluptatem rem et repellat rerum earum officia vel consequatur vel ad impedit perferendis laudantium earum rerum earum quia aut corrupti autem consequuntur similique dolores ut blanditiis fugiat atque aut eaque quod neque alias voluptatem aliquam et id nulla aliquid aut et dolorum sapiente quas.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('71', '1', 'Dolores qui molestiae rerum sapiente totam consequuntur qui.', 'Neque accusamus recusandae est et modi quidem consequatur autem quo quam ab dolorum error veritatis et et sed ut nulla inventore sint officia ipsam neque facilis eos nihil cupiditate quibusdam expedita ut deserunt quidem quo nobis quas autem omnis pariatur voluptas similique numquam sunt rerum sunt in nemo et sint delectus omnis nemo suscipit sapiente nostrum inventore ea est fuga nisi facere iste quo et consequatur quam sint odit sit ut ea tempore porro sapiente nisi sunt sed velit voluptatum ut atque repudiandae nesciunt quas ea voluptatem aperiam amet officiis et qui culpa non ab repellat sint reiciendis et nostrum consequatur nam qui architecto molestiae et voluptatem labore omnis excepturi aliquid molestias molestiae et veritatis ex rerum ea nisi nihil rerum consequatur non nam dolorem aut magni et deleniti id odio et repudiandae quia commodi vel a error reprehenderit rerum necessitatibus enim nihil unde architecto aut facere non cumque ea dolorem asperiores vero rerum et quis aperiam alias corrupti sequi voluptatum et ea et deserunt necessitatibus consequatur nesciunt sint praesentium ut ducimus quod ut repudiandae iure ducimus a est reprehenderit possimus quam tenetur qui voluptatum natus omnis dolorem consequatur voluptatem.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('72', '3', 'Expedita rerum quisquam voluptatem ab.', 'Vitae expedita incidunt velit dolorem similique iure voluptatem doloribus ratione sit consequatur officiis sunt rem fugiat et vitae eum consequatur sunt soluta mollitia sed unde est architecto non animi aliquid et rerum praesentium minus nemo et sed quo fugiat saepe eum est voluptatum delectus impedit aliquid et hic odit necessitatibus ex odio iusto ut rerum officia sit quas voluptatum aut quis fuga alias assumenda possimus omnis eum dicta aut voluptas est dolorum eum et sed non hic adipisci omnis rerum amet odio quasi ipsa ut laudantium atque minus omnis expedita quae illum fuga iure rerum nemo rerum magnam quia ipsam cupiditate sed et dolor est neque non ut quisquam soluta corrupti qui quisquam quo suscipit praesentium quis mollitia officia voluptas praesentium soluta autem facere consequatur qui cumque consequatur sit dolorem ipsam qui fuga laudantium aut aut ducimus sed eum minima mollitia quisquam maxime dicta non excepturi alias reprehenderit temporibus vero sit assumenda exercitationem nesciunt sunt odio facilis sunt sit sit et non ducimus labore mollitia minima quia itaque nam error unde repudiandae recusandae qui voluptas aut quo reiciendis minima impedit recusandae maxime ipsa commodi sunt aut reprehenderit architecto sit aut ea dolor optio libero eos et voluptate modi animi impedit molestiae laboriosam incidunt inventore beatae alias rerum omnis tempora soluta doloremque delectus est occaecati enim vel quis accusamus et ipsa at itaque omnis ut explicabo natus neque tempore debitis debitis dolores reiciendis quas quis nostrum hic temporibus optio quasi et modi non dolores alias est reiciendis et sint est totam ea sit similique voluptates architecto quibusdam quidem voluptatibus maxime possimus similique officia in dolor voluptate id quo tempora et dolor debitis sed repudiandae corrupti atque ratione similique cumque qui odit quia atque ea maxime voluptatibus sapiente consequatur veritatis ab laboriosam doloribus qui magni est cum voluptates eum et dignissimos quos illum alias amet libero ipsam molestiae eos aliquid aut eligendi velit aliquam dolorem exercitationem adipisci accusantium unde tenetur quia in est optio consectetur sed tempora deserunt laborum velit et nesciunt ut error minima nihil eos velit magnam corrupti est nesciunt reiciendis adipisci voluptatem laboriosam voluptatem voluptas cupiditate soluta numquam aut officiis ratione ex ut commodi qui incidunt eveniet odio est sapiente qui in velit est aliquam natus beatae beatae natus neque explicabo vel et illum asperiores quia exercitationem nam sed rem iste optio accusantium maxime harum tenetur repudiandae.', '1', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('73', '2', 'Est quis deleniti iste sapiente beatae vero.', 'Ex id aut sed suscipit expedita et iure exercitationem mollitia reprehenderit ad sunt nulla aspernatur doloribus voluptas iste labore sed tempora aspernatur vitae aperiam esse voluptatem doloremque qui voluptatem ab nemo quo accusamus officia quod corrupti tempora quo inventore eos blanditiis vel quod est ratione voluptas perferendis aut sed totam laudantium harum voluptatibus velit harum sed dolores laboriosam in quis officiis eligendi magnam sed vel eaque aliquam eius deserunt consequuntur consequatur dolorum tempora autem suscipit aut repellat similique aut reprehenderit rem sed cum nihil et harum voluptate ut quisquam eos doloribus itaque quibusdam porro libero minima officia est quaerat quidem asperiores cupiditate dolor est maxime nulla et necessitatibus ab velit ad et quisquam nam qui qui id vel rerum voluptatibus rerum est laudantium id totam ipsam dolor voluptas omnis facilis magni quos sapiente non dolor nihil nesciunt non et voluptatem eveniet qui quidem dignissimos numquam quod sit et voluptate illum quo doloremque tempora optio aut quidem omnis occaecati molestiae omnis dignissimos tenetur veritatis qui quae temporibus eligendi et veniam provident excepturi quaerat sint odit excepturi doloribus non culpa nesciunt consequatur aut maiores rem modi sint non cumque quis porro et earum dolorem velit dolorum dolorum dolorem magni optio autem sapiente et ea molestiae nulla voluptatem hic quia pariatur doloribus excepturi laudantium id ab sed et ea laborum cumque nisi perferendis ea aut laudantium amet perferendis sed blanditiis reiciendis officia tempore rem non commodi similique dolorem cum maiores rerum enim et illum minima reprehenderit est beatae non voluptas maxime et ducimus est laudantium voluptas molestiae qui veniam nobis autem qui voluptatibus et pariatur et suscipit voluptatem sit ducimus est corrupti consequatur optio sint quis dicta similique in suscipit omnis voluptatem error necessitatibus laborum possimus deleniti molestiae doloribus nesciunt repudiandae enim quidem voluptatum modi velit in molestiae suscipit a ut soluta cupiditate vero autem velit dignissimos similique distinctio consectetur placeat est ut atque ut voluptate debitis accusamus repudiandae officia totam similique provident aliquid et totam non sint vel rerum asperiores quia explicabo eos assumenda quo recusandae explicabo est molestiae cumque autem adipisci.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('74', '4', 'Voluptatibus perferendis recusandae iusto voluptatem rerum consequatur.', 'Consectetur et ut quasi nulla laboriosam deserunt quia ut autem enim ipsa quis ea nihil in omnis sit porro et velit rerum itaque quia esse quam iusto ut eveniet eligendi aut eos impedit expedita quibusdam et libero sequi et est corrupti minus quis ea iure totam accusantium enim vero voluptatum tempore ipsam non necessitatibus odio nihil cum ut nemo tempore sunt similique quos nesciunt voluptatem est ut sit illum quia veniam nisi delectus ad quisquam minus harum laborum eaque delectus vel fugiat fuga dicta alias possimus in optio dolorem architecto blanditiis qui neque quis eius fuga mollitia consequatur dolorem dolore voluptatem harum dolores praesentium mollitia quis aut quas blanditiis quis totam et aut fuga et ut veritatis aut doloremque quis nulla esse voluptatem dolor et eveniet et optio occaecati voluptatem asperiores laudantium asperiores exercitationem voluptas odio qui enim odio assumenda amet consequatur nesciunt laborum eos maiores dolorem consequatur nisi et natus at quam consequatur nobis consequatur qui repudiandae dolorem consectetur voluptatem eveniet neque et itaque ipsam earum voluptatem a sed quos fugiat eum omnis ut consequatur ipsum tempora praesentium est unde quia laborum sit explicabo exercitationem et facilis tempore qui at quia quibusdam sequi deleniti laudantium earum consequatur modi reiciendis aut asperiores impedit quas qui quia nesciunt quidem dicta dolorem sit adipisci totam aperiam sequi hic ut eius omnis nihil itaque vel minus ut dolorem distinctio ratione adipisci deserunt voluptatem numquam quia consequatur consequatur nostrum doloribus magni nihil reiciendis eveniet nostrum et eos vel expedita eos in eaque aut est enim fuga nam suscipit qui aliquid ipsa sit molestiae aliquam porro excepturi quasi aut numquam non inventore maxime vero velit quia sunt qui numquam et illo nam consectetur autem beatae natus et iusto corporis quaerat dolor fugit ut ut ea quo doloremque et dolores et qui velit eligendi doloremque minima quia accusantium quos quia quo deleniti quia impedit architecto commodi aut autem nisi omnis et unde nam non amet blanditiis nemo non deleniti nesciunt rerum corporis eveniet maiores.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('75', '2', 'Quos qui nisi molestiae dignissimos.', 'Est doloremque suscipit itaque delectus magni expedita quae eius necessitatibus laboriosam sint non qui nesciunt est non modi corrupti officiis voluptatem qui eum est labore neque earum est adipisci laudantium voluptatem ducimus dolorem nobis debitis vero placeat et voluptatem eos velit eaque mollitia quasi ut eos expedita quos sint beatae voluptates distinctio fuga velit ratione labore quam ad et sunt facilis doloremque sunt laboriosam voluptas excepturi unde facilis ut est eos enim expedita consequatur officia nisi est cupiditate et aliquid dignissimos quas enim occaecati dolores non aut dolor alias et minus dolorum rerum at eos praesentium est qui magni dicta suscipit quibusdam sed consequatur error cumque repudiandae similique autem dignissimos quod aut consequuntur eveniet quisquam ut sint modi voluptas ea laudantium laudantium excepturi temporibus aperiam et similique perferendis repudiandae minus quaerat enim optio expedita pariatur assumenda natus eum amet ipsam sint error sit eveniet aut quis praesentium ab sed a deleniti autem et minima illo sint et vitae ut culpa dolore eos laborum id qui omnis impedit adipisci est quis maiores tempore eaque nostrum eum ullam et beatae ab excepturi qui quasi ea perferendis quia beatae quo vitae blanditiis dolor veritatis quia dolores quasi aut ex excepturi error sint dolores expedita accusantium repudiandae non ea in ullam hic corrupti doloremque eius in totam in est veritatis beatae dolorum sunt officia labore explicabo vel tempore qui voluptas molestiae fuga ea et iste animi provident et dolore nesciunt saepe assumenda consequatur possimus odit excepturi ea pariatur est blanditiis sint aut non aut asperiores nulla eaque excepturi officia consequatur itaque officiis facilis explicabo tempore nihil dolorem sit quo consequatur et odit quia sit quia aut dolor sed aut deleniti perspiciatis voluptas perspiciatis modi officiis modi laudantium