INSERT INTO `course_news` VALUES ('76', '10', 'Voluptatibus qui ratione aliquid alias quia possimus ab.', 'Magni et qui voluptatibus et est velit quas enim in reiciendis rerum quia occaecati corrupti officiis et ex excepturi et amet quia corrupti suscipit quis quia aut vel ullam soluta non odio animi et in voluptates autem minima doloribus numquam ut sequi vel in molestias vitae sed eum beatae quas harum enim quae quas consequatur temporibus beatae doloribus eveniet autem commodi et commodi rem ullam unde facere distinctio optio fugiat alias et saepe ea et dicta quam tempore non atque consequatur et in autem assumenda vel tempore saepe nesciunt quis voluptate et dicta dolor et provident voluptatem expedita perferendis tempore voluptas beatae enim consequatur officiis neque quia quis et non eveniet incidunt quia exercitationem nesciunt consectetur alias voluptatem ducimus mollitia est ea similique et a fugit expedita magnam non sunt laborum totam molestiae quia optio neque eos ut dignissimos totam odit voluptas quas voluptas rem sunt cum cupiditate libero aspernatur non quo facere saepe provident sequi est enim ut veritatis modi voluptatibus enim qui asperiores ducimus exercitationem amet qui debitis et qui numquam exercitationem reprehenderit sed voluptas possimus laborum molestiae quidem adipisci aut ullam officiis repellendus qui reprehenderit nobis non perferendis voluptates velit quia dolor adipisci aut minus eligendi ex quia et beatae est veritatis omnis repellat sit in doloribus voluptatem et expedita et maxime reiciendis sunt assumenda recusandae commodi sunt omnis optio harum culpa dolores odio aut impedit corrupti amet cupiditate qui aperiam nam cumque numquam eligendi et voluptatem et et ut autem eligendi et provident quo culpa quo est corrupti quisquam itaque facere sunt voluptas aut officia aut iure maxime ducimus laudantium et eum occaecati quia ea veniam pariatur et dolor voluptatibus repellat quia non libero est possimus dolorem sapiente explicabo err