INSERT INTO `course_news` VALUES ('77', '5', 'Et vel libero rem dolores nobis ullam neque aut.', 'Eum quos qui voluptas voluptas asperiores fuga autem rerum sit inventore qui distinctio reiciendis mollitia voluptas voluptatem aut commodi itaque et impedit quisquam molestiae adipisci sed sed ut consequatur quia cumque quam magnam officiis ab eos eligendi odio dolores ut sit enim alias odit enim autem ipsum assumenda dolorem itaque molestiae quia mollitia maiores rerum distinctio ad pariatur non quas est repudiandae numquam provident nihil consequatur molestias molestias magni sed est et numquam aut ratione adipisci vel fugit et at aut aperiam eos commodi animi non corporis id optio dicta omnis totam sint magnam vitae qui optio modi commodi cum sequi veniam sint fugiat recusandae voluptatum quidem totam qui velit nam necessitatibus assumenda tempora at eum ut voluptatem non quia voluptatem repellendus eius qui est cumque facere sapiente dolor est ipsa nostrum sed dolorem assumenda rerum eum alias qui at ut ut aspernatur quae occaecati sed rerum perspiciatis voluptatibus nulla doloribus minus delectus exercitationem laudantium mollitia in nesciunt excepturi non magnam sed porro ea aut optio quo error non enim officiis soluta sint beatae odio facere asperiores et aliquam nulla soluta quae nemo maiores necessitatibus quae distinctio et reiciendis est nobis architecto et fugit sit quia aut consequatur similique tempora odit voluptas alias est esse ut magnam aliquid non ipsum saepe libero ab aperiam veniam non fuga necessitatibus soluta facilis sapiente atque quo dolorem officiis consequuntur beatae illum consectetur dignissimos est praesentium praesentium molestiae repudiandae qui unde nulla quas a sed ea rerum omnis facere voluptas corporis.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('78', '9', 'Optio maiores quam id sint id corrupti.', 'Qui voluptate quod repellat asperiores ex quia ipsa et et culpa temporibus enim ut quam natus alias accusantium doloremque laboriosam non qui assumenda impedit illo error rerum dolor ad ut voluptatem dolorem perspiciatis accusantium odio beatae eveniet expedita molestias sint et aut eaque a earum distinctio sit voluptate fugiat atque repellendus accusamus eius harum soluta adipisci eos amet excepturi nemo nulla libero in laboriosam earum sit quasi expedita fuga nisi sint fugit nesciunt et ipsum quam et sit minus molestias repudiandae voluptatem alias exercitationem est aut cumque voluptates ad fuga est minima tempora tenetur fugiat incidunt blanditiis ipsa enim perferendis molestiae et maxime dignissimos ut ducimus similique quia quis cupiditate unde illo occaecati commodi delectus id qui expedita ut magnam earum enim recusandae nisi adipisci eos nemo alias eius aliquam minima sequi praesentium odio placeat dolorem incidunt sunt magni quia sint distinctio est illum voluptatem corrupti neque minima ea temporibus ad qui voluptatibus architecto reprehenderit quo aut exercitationem dignissimos cumque asperiores necessitatibus nobis modi mollitia et eaque cum tempore error perferendis consectetur amet voluptatem dicta eaque necessitatibus quia repellat qui ut necessitatibus sunt aut voluptatum et sint sit veritatis vel sit alias tenetur fugiat ut tenetur vitae consequuntur ducimus quas dolor maxime cum odio aut et tempore qui impedit magni ea cum accusamus iusto et perferendis quo libero et molestiae ipsam quisquam dolores aperiam earum voluptates maxime consequatur iure labore ea et corrupti rerum laboriosam facere quia sunt aut veniam quaerat et adipisci numquam accusamus qui voluptatibus eius sint dicta incidunt qui aliquid totam expedita natus est cum cupiditate.', '1', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('79', '1', 'Ut et ut est voluptatem.', 'Eius eos quae earum rem qui quia exercitationem perferendis dignissimos totam temporibus maiores nisi iure nemo numquam et quia eos eos tempora aut quaerat voluptas nam in sint occaecati magni deserunt architecto voluptatem commodi fuga consequuntur natus mollitia sunt debitis qui aut sed accusamus ad est molestiae commodi porro earum eum repellat omnis aperiam eligendi labore non et architecto consequuntur nemo repellat tempora reprehenderit et explicabo odio soluta consequatur odit ipsum eaque nobis quia itaque deleniti culpa saepe praesentium aut qui id fugiat laborum modi delectus adipisci sunt voluptatem eaque accusantium aut quibusdam vel exercitationem voluptatum ipsum et minima earum animi praesentium numquam aperiam dolore excepturi id dignissimos reiciendis rem cupiditate fugit aperiam modi ut ab vel eum repudiandae qui ad sed et tempora corrupti sunt et neque voluptatum sunt corrupti assumenda quo eius dolorem et inventore omnis sint non culpa sit quas et quas vel neque in consequatur est omnis voluptatibus nostrum iste quia quia quia quis neque unde alias sit ea voluptatem suscipit sequi qui quod sed quia expedita aut earum odio distinctio iusto provident labore voluptate quia possimus consequatur est sapiente numquam sit voluptatem error nostrum expedita unde vel occaecati culpa libero soluta ut aperiam atque delectus quia dolores reiciendis et tenetur est quasi ea doloremque consequatur possimus voluptas et modi aliquid est quo modi neque natus quia esse distinctio nulla voluptas omnis aut sapiente magnam.', '0', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('80', '9', 'Ea repellat reiciendis iusto quia.', 'Dolore et consequatur dolores architecto impedit nihil qui aut harum natus est maxime repellendus fugiat qui delectus recusandae maxime voluptatem ex nam et dolores illum natus error aut voluptate similique eos ad alias itaque vitae reprehenderit vero molestiae mollitia quis autem a nesciunt alias ea ipsum aut dicta perferendis minima et asperiores optio nulla aut voluptate recusandae voluptas nesciunt reprehenderit iusto nihil et vitae voluptatem nihil id odio doloribus iure itaque consequatur est cum rerum recusandae vel commodi mollitia modi reprehenderit incidunt amet quia ab id aspernatur et qui ipsa exercitationem dolorem ea perspiciatis repellendus ratione eius nihil et consequatur asperiores voluptates est et aut animi dignissimos qui ipsum ut quam voluptatem earum temporibus et deleniti quidem ea et ut ut possimus consequatur qui ea deserunt eaque et quia ut praesentium et ut amet animi ut maiores exercitationem qui fugit consectetur ut voluptatem dolor ratione enim recusandae provident architecto recusandae ducimus architecto esse similique soluta quam eaque et quos aut aut sunt vero numquam placeat aliquam temporibus et et cum dolor totam autem ut aut quas facilis numquam corrupti ut aut iure sequi quia dolor dolorem libero quibusdam illo nihil provident quae numquam sit aut odio qui officiis autem nihil sint similique est mollitia sed repellat ad qui excepturi delectus rem.', '1', '2017-05-02 22:58:46', '2017-05-02 22:58:46');
INSERT INTO `course_news` VALUES ('81', '4', 'Deleniti ea libero itaque voluptas mollitia sint eligendi.', 'Est esse dolores reprehenderit similique delectus placeat fuga reprehenderit id sint doloribus voluptas aut nihil consequuntur sequi officia reiciendis incidunt odit dolore aperiam dolores cupiditate doloribus est non qui et sunt eos sed et et dolorem cum fuga ut mollitia quae qui iste alias rem et qui placeat reprehenderit ea corrupti sunt voluptatem sint velit unde velit enim ut consectetur molestiae voluptas repudiandae quia ipsam et et est recusandae repellat non rerum nostrum doloremque tempore omnis quia et voluptatem aliquam alias et quos aut ducimus fugiat suscipit soluta vitae ut officia a architecto error incidunt deserunt deserunt consectetur odio doloremque omnis iure aperiam est fugit quos voluptas et quae inventore nesciunt et aspernatur voluptatem et quo distinctio doloremque dolorem perspiciatis quasi laudantium qui nam quos amet corrupti est nihil inventore praesentium aspernatur ipsum minima reiciendis expedita reiciendis maiores veritatis distinctio distinctio ratione rem voluptatem ullam est sunt repellat labore voluptatum libero nam mollitia harum cumque maiores voluptas aut qui ullam ut aut inventore aliquam esse necessitatibus quibusdam laborum nihil labore voluptas aliquid rerum eos porro voluptas qui cumque sunt ut animi dignissimos pariatur omnis voluptatem provident porro impedit atque est vel recusandae eos aut consequatur aperiam nostrum fugiat fuga est harum id.', '1', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('82', '8', 'Aut nihil veritatis delectus sint et.', 'Expedita necessitatibus voluptas vel hic consequatur ullam quos dolores dolores rerum velit itaque aliquid delectus et autem magni provident labore dolore itaque eos et autem libero non vitae suscipit enim ipsum vitae pariatur ea cumque voluptas aut doloremque voluptas rerum nisi corrupti adipisci ut enim consequatur quia inventore sed maxime nobis quibusdam incidunt porro eos voluptatem sit delectus eius fugiat dolores exercitationem non sint recusandae sed asperiores accusantium voluptatem aut ducimus laudantium tenetur repellat iste dolorem delectus eligendi rerum perspiciatis saepe quis dolor vel sint unde eius dolorem qui quia et ut ipsam explicabo qui alias pariatur consequatur pariatur eum et nihil ipsum assumenda sit est quidem perspiciatis aut debitis aliquam unde est recusandae pariatur ducimus praesentium enim molestias id excepturi est aut id cupiditate rerum et eos quia recusandae consequuntur dignissimos voluptatem voluptas eveniet non qui excepturi repudiandae repellat sunt velit aut nisi voluptatem dolor illo et qui quis tempore consequatur amet est aspernatur qui facilis placeat et consequatur est ut quam ad animi eos velit aperiam ea sed sapiente omnis omnis et aut quia explicabo et harum architecto iure.', '1', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('83', '3', 'Sequi perspiciatis corporis est natus explicabo et repudiandae.', 'Vel aliquid amet sed voluptatibus earum beatae totam natus quisquam quis labore reiciendis repudiandae maxime autem quisquam molestiae magni sapiente ipsum quam est possimus rerum suscipit adipisci ut voluptatem consequuntur alias perspiciatis nostrum perferendis numquam aliquid ex optio quo est eum harum et doloribus minus placeat et delectus facere et iusto perspiciatis laborum magni eaque aut voluptatem sed commodi earum ipsa fugiat in fuga nihil aliquam in officia quis est molestiae inventore odit dolorem dolorem facilis assumenda amet exercitationem quam tempora fugit repudiandae commodi est voluptatum doloribus distinctio autem sequi omnis qui aliquid autem dolorem aperiam ad non molestiae accusantium quam officia dolorem necessitatibus veritatis porro necessitatibus dolores enim qui distinctio iste aut corporis sit qui cumque et voluptatibus autem aliquam et enim numquam eligendi sit maiores molestias tenetur velit asperiores id eos molestias nobis et aliquam et enim laudantium sint molestiae rem quia error odit fugit officia architecto quaerat laborum ab qui odio velit optio perferendis quis animi nam placeat ad voluptatum dolorem et aut nostrum molestias ut repudiandae deserunt explicabo voluptas aliquid quia nostrum cumque quo suscipit doloribus eaque iusto et quas excepturi sequi facilis sed aut aspernatur voluptatem dolorem et enim nemo soluta facilis ea sit.', '0', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('84', '1', 'Provident ut cupiditate quod qui voluptates rerum aliquid.', 'Corrupti voluptas voluptatem placeat incidunt quas est placeat et exercitationem aliquid mollitia quia aperiam ut eum sed aperiam est dolores adipisci laudantium qui commodi dignissimos assumenda id doloremque alias odio qui dignissimos nostrum quaerat similique optio ipsam enim dolorem et vitae iusto non quam ea sint voluptatem dolor amet consequatur fugiat reiciendis nesciunt adipisci qui sed aliquid similique deleniti qui voluptatem dolorum sint aut necessitatibus accusamus in architecto natus ducimus est voluptate ut soluta officiis nemo corrupti aliquam sunt iure ut maxime consequatur molestiae voluptatem ipsum earum distinctio ad iusto occaecati cumque beatae nihil ratione laboriosam consequatur molestiae voluptatem ducimus in ea doloremque omnis ullam ipsam ut dolorem labore dolorum praesentium eum quaerat repellendus ad nobis temporibus quo repellendus ratione quidem minus porro vero ullam et quas et consequatur mollitia fuga unde similique ab quia dolores ad molestiae odit laboriosam laboriosam velit qui porro id magnam vitae architecto quam ut laborum velit eos tempora nisi quibusdam dolores non inventore aut nulla quibusdam eos occaecati impedit laboriosam vero iusto rerum quibusdam qui aut impedit est dolores corrupti rem occaecati voluptatibus eveniet voluptas quasi et cum quasi sit fuga maiores labore dolorum error ut temporibus ipsa magni error et voluptas sunt et voluptatem maiores molestias quam aut expedita esse iusto et quos odit ex praesentium dolore aut et ad est est incidunt et et totam libero ut provident nisi nulla vel.', '0', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('85', '1', 'Praesentium dolore consequatur autem qui atque sequi aliquam molestiae.', 'Facilis sunt officia sit cupiditate asperiores error iusto veritatis quam nihil beatae nisi sunt molestias cupiditate omnis et voluptatem nobis ab in eveniet voluptatum repellat autem vel ut harum sit velit ullam vel quo mollitia aliquid voluptate provident similique nihil quae nobis velit ipsa error error dolorem harum aut sit adipisci fuga et distinctio quod sit accusamus eum hic velit sed quis nesciunt voluptas dolores quidem corporis quod veritatis libero deleniti earum eos explicabo expedita labore nulla tenetur fugit totam voluptatem ad necessitatibus quae ut molestiae vel nihil aperiam animi repudiandae molestiae velit sint quia tenetur unde perspiciatis in et facere ad natus est quia pariatur sapiente sit reprehenderit accusantium explicabo expedita velit ea quis mollitia facilis ipsa est consectetur consectetur nobis dolorem et dolorum ex sed ad et atque est deleniti odio placeat sequi delectus mollitia sunt qui in necessitatibus omnis quia esse consequatur nihil consequatur animi fugiat quaerat laboriosam magni blanditiis reiciendis delectus tempore qui esse et ipsa occaecati nostrum aliquam qui quod quaerat dignissimos culpa hic et quis nihil ullam explicabo quae ut fugiat atque ut sint ut delectus debitis doloremque dolores omnis ab fugiat placeat ut voluptatem rerum qui doloremque aut harum aspernatur et omnis deserunt aspernatur quaerat quis velit quas provident rerum amet tempore officiis quo voluptas rerum esse sit ullam laudantium a quas earum temporibus earum aut quia quidem asperiores vel possimus id vel fuga voluptas et pariatur placeat laborum quod sint deleniti sequi ut consequatur quis ut aut iure iste magni non vel quia aspernatur debitis vel sunt enim rerum alias numquam aspernatur fugit quod et molestiae magnam qui non nihil ipsa est amet eaque nisi qui error delectus voluptas voluptas nobis deserunt repudiandae nihil omn