INSERT INTO `course_news` VALUES ('86', '1', 'Velit pariatur quo sit expedita omnis unde cupiditate nulla.', 'Deserunt doloribus atque ab inventore est ipsum iste autem consequatur assumenda aut fugiat illo id at quia explicabo beatae veritatis odio molestiae id a at quam excepturi ullam asperiores quas ipsa ipsum aut et eum vel vero modi hic ut sed est sunt odio excepturi nihil architecto alias praesentium enim ea omnis non in excepturi pariatur odit incidunt sapiente sint nihil corporis consequatur quas voluptatum et qui est velit cumque labore ipsam aut corporis iure qui sed omnis quia doloremque error et aut unde in aut ipsum ut esse explicabo unde distinctio error dolor quia id quibusdam tenetur qui corporis et sint illum id repellat veniam delectus excepturi qui at qui architecto maxime illum voluptatum omnis incidunt voluptas dolorem occaecati modi perspiciatis adipisci debitis quia quia dolores omnis unde eum et numquam sunt eos voluptas vel modi incidunt doloribus quia distinctio dolor enim dolore ut eveniet expedita minus id dolor alias fugit quae et officia similique atque accusantium illum cum hic nobis non consequuntur reprehenderit qui ut qui aut et dolor qui autem fuga placeat recusandae ea doloremque et qui beatae temporibus sit quaerat ea perferendis non dolor molestiae voluptatum accusantium ut voluptatem iste commodi et ut illo dolor necessitatibus incidunt excepturi maiores iure quae debitis maxime amet asperiores et magni cum inventore est accusantium temporibus quo omnis earum nulla et numquam ut et qui perspiciatis vitae in nostrum tenetur itaque sequi quia expedita similique ipsa nulla et iste est maxime quisquam unde et et sapiente sunt dolore quod expedita sed et vel eaque dolor illum qui est impedit natus commodi pariatur velit ipsum sit dolor rem et sit dolorum illum ratione aut aut illo ab reiciendis fugiat voluptatem adipisci commodi qui soluta quo id asperiores et minus illum sit mollitia accusamus in fuga est non quibusdam veritatis autem ex quo itaque omnis aut voluptatem optio qui nesciunt voluptatem error voluptatum ut omnis et hic ut est qui optio beatae illum voluptate est sit ut omnis rerum consectetur velit eius illo eius velit aut modi ullam ut est saepe officia suscipit repellendus ad ad provident voluptatem dolores sequi quia accusantium dignissimos ut repudiandae iste quod cupiditate quam omnis possimus quo illo rerum qui molestiae vel voluptatum ut labore praesentium odio debitis quod quibusdam minima ullam ab.', '0', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('87', '7', 'Sunt eligendi repellendus vel quis nisi assumenda.', 'Exercitationem sit earum atque ut pariatur animi illum nulla inventore qui perferendis non explicabo ab consequatur velit consectetur odio reprehenderit deleniti laborum quasi praesentium excepturi vero occaecati consequatur esse illum quasi ex ut ratione voluptatibus ut non dolorem repudiandae sit quos minima et est non adipisci non iusto quia aut quidem qui distinctio ut unde quia nam vero dolorum molestiae quas et illo dolores cumque maiores impedit delectus quia repellat est esse quidem consequuntur in quo officia culpa eos illum placeat similique quaerat pariatur iusto est assumenda consequuntur in et quam quis iusto excepturi quaerat dolor hic ut a provident vero id in delectus tempore perferendis voluptas dolorem similique vero ipsa neque autem fugit aliquid delectus vel omnis est architecto aut explicabo laudantium omnis voluptates similique rerum est incidunt quo voluptatibus reprehenderit officiis magnam provident dicta voluptatem deserunt culpa consequuntur quam maxime tempora molestias fuga quia omnis voluptate adipisci dolorum ipsum quasi tempore id doloribus et autem et nostrum doloremque ipsam aliquid molestias molestias iusto rerum quas soluta tenetur laboriosam et tempora vitae facilis officiis aut ea nesciunt quis ut pariatur et velit perspiciatis commodi incidunt eveniet aut nemo ab sequi dolorum vel voluptas dolore explicabo ut voluptas expedita aliquid quasi et similique ut ut magni repellat rerum sit veniam et facilis voluptatem doloremque cumque molestiae optio perspiciatis est accusamus expedita quis totam consequuntur et esse qui fugit est non placeat doloremque quod rerum tempore recusandae nesciunt omnis id laboriosam expedita deleniti et odit quia a eligendi dicta excepturi alias autem et deleniti maxime et beatae beatae quo aut exercitationem hic placeat molestiae eos consequuntur ut ut quam aut quisquam voluptatem non asperiores quis recusandae cupiditate quis ut dicta incidunt officiis mollitia est nulla doloremque expedita quibusdam accusantium velit quod repellendus cupiditate quia quam autem consequuntur saepe qui eligendi repudiandae ea rerum illum ut ab reprehenderit expedita dolores ut vel et et asperiores et dolorem pariatur in enim porro aut doloremque et quis laborum nesciunt neque quisquam et eum doloremque et.', '0', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('88', '2', 'Enim esse rerum consequuntur voluptas debitis cum.', 'Nemo minus eum ex nihil est provident et minima aut nostrum et ut magni eos quam consequuntur autem cupiditate sunt voluptate ducimus voluptatem blanditiis deserunt sed quas id saepe sunt et rem esse quasi quam optio et eum quis distinctio sapiente ea enim reprehenderit voluptatum officia laudantium sequi itaque ipsa itaque eum illo facere voluptates nihil veritatis error praesentium sit quo expedita voluptas placeat quaerat est iure corporis ut id iste eaque quisquam sint laborum et id reprehenderit et odio est labore quia quia neque sequi nulla nam molestiae sapiente illum odit magnam officia eos est ea corrupti nihil et consequatur nostrum iste nulla modi ullam tempora ut repellendus unde aut aut nam omnis fugit sint voluptates libero officia magni optio maxime sed aut delectus excepturi minima velit nemo reprehenderit tempora ratione possimus sunt ab saepe est voluptatem dolor impedit nihil doloribus libero ullam odit quis iste velit animi saepe vitae et aspernatur quia et neque ut veritatis et sit facilis repellat non quidem itaque iure explicabo ea blanditiis quo et nobis velit velit fugit aspernatur in cumque sed reiciendis nihil tempore asperiores nam facere quisquam et voluptas fugit commodi ab quod ea iure fuga laudantium et et possimus molestias eius ea nobis est deserunt laboriosam non nulla recusandae earum sit quos provident cupiditate consequatur explicabo et quasi veritatis dolorem expedita quam officiis vel laudantium qui possimus et sunt blanditiis voluptas nobis natus aperiam voluptates facilis et et enim ut est ut eos accusamus optio quia perspiciatis tempora voluptas cumque aperiam minima dolor mollitia quia optio facilis quos incidunt dolores quisquam nostrum molestias qui enim quam dolores et saepe expedita est pariatur est dicta earum ad doloremque in dolore in et nisi eos et perferendis mollitia praesentium nesciunt ullam dolores iusto qui eum