INSERT INTO `course_news` VALUES ('89', '8', 'Itaque id dolor asperiores sequi.', 'Et et recusandae rerum ut omnis tempore maxime totam labore sit asperiores atque rerum est odit blanditiis a maiores incidunt sequi porro eveniet expedita praesentium exercitationem fugit similique saepe fugiat natus aliquid voluptatem consectetur repellendus enim recusandae ea cum voluptatibus rerum maxime alias voluptatem est harum maiores qui cumque ratione aperiam vitae autem neque explicabo vitae maiores fugiat debitis architecto magnam molestias fugiat animi nihil aliquid repellat nobis quibusdam est officia aut fugit molestiae est et eos magnam recusandae vero odio iure porro eveniet expedita labore velit cum officiis sint ex rerum odit maiores delectus laboriosam magnam impedit ut quis nihil repellat quia est voluptate beatae aspernatur sint nisi quis fuga architecto et dolore labore soluta illum voluptatibus ipsa et error similique quas et et magni et maiores eos nobis enim ut fuga mollitia rerum eos autem nesciunt omnis ut beatae deleniti et necessitatibus ipsa sed id non magnam labore error accusantium sit et et aut et rerum recusandae amet non dolorem illo doloremque eum occaecati voluptas saepe quia officiis omnis hic incidunt repellendus atque consequatur doloremque voluptas voluptatem autem autem doloremque labore laudantium amet sunt saepe blanditiis et distinctio quae vitae voluptatem non esse temporibus adipisci similique suscipit assumenda illo rerum excepturi et omnis iste cumque blanditiis sint suscipit voluptatem autem sit sint distinctio laudantium ullam rem ut ipsam dolorem omnis molestiae quaerat eveniet quo voluptatem ut aut quia cumque reiciendis voluptatem facere asperiores ut ab ex dolore magni non sint molestiae at sapiente nostrum ipsam molestias perferendis impedit tempora vel culpa ipsam alias eius saepe veniam omnis repellat et incidunt et qui velit vitae inventore a esse voluptatem explicabo magni dolores deserunt qui tempora magni minima a autem qui