INSERT INTO `course_news` VALUES ('90', '1', 'Laboriosam at id quis iure vero culpa.', 'Rem ex accusantium est magnam sed est accusamus nobis quae eveniet non neque veritatis ut nesciunt voluptate modi corrupti magni et voluptas et eos molestiae ea corporis rerum quo et voluptas et rerum eos eum repudiandae consequatur vel qui et tempore ullam quo mollitia explicabo rem quia aut libero ipsa ad quis vel inventore et quidem pariatur ut vero itaque totam neque qui officiis eius eos dolores fugiat et et voluptas omnis nostrum rerum omnis corporis officia voluptatibus culpa hic ut illum velit eos repudiandae aut culpa corrupti minima ipsa laudantium rerum quis consequatur et doloremque architecto qui qui quia laborum et culpa voluptatem repellat ad eaque ad laboriosam atque cum est natus reiciendis est fugit ut ut rerum perspiciatis quod aut recusandae quis dignissimos dicta perferendis impedit voluptas eveniet et magni ratione et nemo eum distinctio odit perspiciatis odio et quia et quod alias architecto molestiae neque nemo et neque voluptatum quas et vitae doloribus voluptas soluta commodi repellat esse est recusandae quo vitae et consequatur minima porro delectus consequatur quae nobis maiores maxime necessitatibus in cum quae qui illum iste temporibus voluptas sequi quia non voluptas totam reprehenderit voluptas in eum sed et debitis sequi quaerat deserunt a dolores suscipit blanditiis aut reiciendis id accusantium ut in odio ut numquam officiis suscipit dolores beatae et quia excepturi non similique est magnam aspernatur recusandae itaque doloribus quidem eveniet.', '1', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('91', '4', 'Qui soluta quia est aspernatur est blanditiis et in.', 'Aut sint voluptates pariatur non aliquam sunt magnam enim est odit repellat quisquam ea ipsa dolor sint voluptatibus distinctio eaque molestiae incidunt explicabo quia nisi ut ratione suscipit et omnis repudiandae tempora repellendus et dolor aut dolorum consequatur labore fuga corrupti aperiam debitis non minus illo est esse et ut qui expedita aut similique quaerat qui veritatis ea nisi et fugit possimus amet fugiat possimus facere at debitis numquam est quisquam totam sint nesciunt vero repudiandae quis et dolorem iste aut nemo omnis id aut qui dolorem omnis tenetur ut repellat quae voluptas aut aliquam ad maxime illo voluptatem consequatur tempora impedit ea perferendis nemo voluptas placeat adipisci consequatur natus accusantium eum velit et excepturi eveniet dolores eos fugit ipsam rem enim ea necessitatibus dignissimos rem necessitatibus voluptates suscipit eos non nesciunt neque labore et consequuntur laudantium natus odio assumenda voluptatem eius non quidem dolorem sit ullam quo fuga explicabo magnam rerum dolor ut recusandae aut aut voluptates asperiores dolorem doloremque aut eos consectetur reprehenderit necessitatibus voluptatem qui esse tempora quo dolor autem doloremque et eaque quia corporis dolorum necessitatibus maiores quo excepturi aut dolorum qui nulla id enim et corrupti est laudantium soluta nobis et magnam magnam recusandae animi non sit qui aspernatur quos excepturi dolor beatae quos animi deserunt quis magni ab sequi voluptas laudantium consequatur neque dolores et et non alias qui voluptatibus ut quo dolorem omnis deleniti ut voluptas accusamus iure at inventore error tenetur et est hic beatae distinctio est aut alias aut mollitia et omnis beatae repellat rerum quia eaque alias ipsa rerum modi rerum necessitatibus tenetur et nihil debitis error sunt assumenda enim repellendus iure sit exercitationem eaque quo debitis doloribus ut amet pari