INSERT INTO `course_news` VALUES ('92', '1', 'Et ad fuga perspiciatis totam eum voluptas laudantium.', 'Voluptatem vitae accusamus harum autem voluptatem blanditiis officia soluta officiis maiores eaque doloremque sequi quis in enim quo deserunt velit suscipit adipisci quasi itaque sit ad dolor nobis in ipsam rerum eum excepturi cum error sequi provident incidunt dolores impedit hic id recusandae animi et quos architecto vero ipsam quam maiores non maxime laboriosam nihil iure pariatur rerum qui dignissimos quidem optio qui suscipit nostrum et nobis itaque consequatur et qui ea accusantium qui veritatis reiciendis consequatur qui quia nobis suscipit aliquid omnis fugiat inventore fuga sequi sapiente sit repellendus optio veniam qui autem animi enim dolorem placeat porro corrupti unde aut illum dolorum magnam minima asperiores perferendis corporis possimus quis et sint accusamus cupiditate quo voluptatem suscipit assumenda dolore labore et excepturi nam consequuntur facilis autem provident rem ducimus perferendis quasi qui dolore at tenetur iste ad eos doloribus velit quaerat cumque ducimus veniam molestiae perferendis est labore consequuntur enim libero et tempore eaque pariatur qui et totam corrupti eos quis cupiditate amet esse accusantium molestiae possimus consequatur praesentium molestiae ea vel recusandae quidem nostrum sed vel beatae qui quis quasi ut nobis blanditiis quod perferendis voluptas et distinctio vel nesciunt similique repudiandae asperiores nobis voluptatibus inventore aliquid deleniti dolore porro illum illo porro in doloribus sed earum id omnis quisquam illum consequatur aut nostrum odit veniam aliquid voluptatem et et consequatur magni qui recusandae rerum delectus voluptatem inventore aspernatur ab dicta molestiae incidunt rerum voluptas sint consequatur praesentium delectus non omnis ut tempore est id et dolor sit eligendi est dolor hic distinctio rerum expedita ut praesentium nulla ut perferendis officiis facilis praesentium assumenda accusamus unde enim et minima est sed et illo doloremque ut officia sint delectus et qui dolor sed et ut minus assumenda fugiat rerum commodi saepe voluptas illo sit optio vero consequatur accusamus repellat maxime autem omnis dolores corporis est dolores laboriosam officiis est voluptas quis explicabo quia at minus illo reprehenderit neque dolor et in blanditiis repellendus ad a quia iure vitae vitae modi modi dolores sit eius eos perferendis a facilis vel impedit nemo et harum nihil dignissimos velit est aliquid dolore exercitationem laudantium ab et ut qui est dolores.', '1', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('93', '1', 'Eaque neque vel id quia nihil numquam odit.', 'Animi reiciendis sed repellendus qui est qui aliquid quod eius in illo eveniet non iste iure voluptates mollitia omnis architecto rerum quia aperiam voluptatem quo rerum consequuntur dicta voluptas est qui totam labore consequatur maiores sequi rerum asperiores voluptatum pariatur quam totam doloremque cupiditate quasi voluptatem rem vitae et a omnis ut et sit similique autem sint praesentium fugiat repellendus molestias voluptatibus numquam laudantium et voluptates similique sed ex repudiandae cupiditate ullam quasi quam aut praesentium libero velit consequatur necessitatibus ut rem nemo repellat illo dolorem voluptas dolore labore aspernatur vero velit velit corporis et quia laborum fugit tempore modi voluptates sequi deserunt maxime ut ut dolor ut occaecati maiores aut id odit explicabo pariatur quo non omnis minima quidem fugit praesentium distinctio maxime et possimus nobis nulla nobis alias voluptatum dicta repudiandae temporibus velit perspiciatis velit quis et optio sed tempora aut sapiente nihil consequatur nulla molestiae quibusdam quisquam aut quo eos quisquam aut facilis rem dolor quidem autem velit qui et aut magnam vitae vel tenetur nemo natus quaerat odit ab voluptatem sed deleniti sit consequatur enim itaque in et repudiandae quos voluptatem magnam blanditiis laborum nesciunt molestiae soluta molestiae qui voluptatem quibusdam quis animi velit vero adipisci ullam nihil eligendi non illum sed et aliquid quia qui nemo similique voluptatibus velit eius omnis quas deleniti dolor in veniam rem ut sit fuga iste aut dolorem ab suscipit iste nostrum qui dolores quibusdam ut sed exercitationem aperiam amet ipsam blanditiis voluptates quisquam vel debitis inventore et sequi ea fugit quas aut sed natus doloribus porro sed accusantium veniam sit consectetur qui blanditiis dolorem ea iste rem adipisci excepturi autem nobis ut sit qui itaque molestias doloremque ut sint voluptates quidem placeat earum qui voluptas quisquam officiis nesciunt velit praesentium voluptas voluptatibus tempore qui tempora dignissimos non ducimus quis dolores non voluptatum voluptatem odit sed explicabo corrupti dolorum sunt iure dolores voluptas natus odio quibusdam nam totam voluptate laboriosam odit veniam beatae provident et et sint qui tempore dolorum et aut aut omnis laboriosam sapiente mollitia qui repudiandae voluptas quo fugit minima facilis id beatae consequatur dolor facilis itaque enim sed eum omnis assumenda et harum est non blanditiis et reiciendis repellat ipsa consequuntur vero aliquam itaque labore odit molestiae sit tempore ut ipsa consequatur.', '1', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('94', '9', 'Nesciunt inventore consequatur nostrum nisi expedita exercitationem.', 'Maxime quia provident dolorem atque placeat et facere praesentium dignissimos sint voluptatem rerum qui rerum ea repellendus occaecati dicta possimus quidem deleniti et quasi facilis dolores veniam illum magnam a vel et sit velit autem fugit perspiciatis corrupti placeat modi consequatur sed qui maxime eveniet occaecati deleniti nostrum vel ut vitae qui rem quis similique aut dolor in hic at ratione error maxime recusandae eius eius nemo ut velit omnis aut veritatis voluptatibus nesciunt delectus voluptate ut dolorum corporis soluta officia id animi molestiae velit asperiores quam aliquam repellendus voluptatem fuga doloribus unde similique quaerat expedita beatae vel voluptas rerum dolorem nihil aut vel vel soluta reiciendis voluptatum distinctio ut sed qui et non odio enim eius sapiente minima tempore voluptatem omnis dolores quasi accusamus ducimus illum magni qui numquam qui eum atque reprehenderit ex corporis quis adipisci cum fugit delectus consequatur nihil labore velit temporibus est vel ullam ratione blanditiis perferendis officia nesciunt animi molestias amet assumenda error molestiae vero est omnis esse sit et ipsum possimus culpa facere libero sit molestiae veniam quo necessitatibus consequatur quidem facilis quia pariatur a ipsum error repellat aut non quidem rerum cumque aut harum qui et velit placeat labore excepturi magni necessitatibus omnis voluptates mollitia eum aut voluptatum quibusdam mollitia reiciendis magni placeat sequi perspiciatis sunt voluptatum inventore deserunt aut dolorum animi et eos aut iusto eos perferendis qui dolores minus animi accusamus repellendus fuga numquam blanditiis autem aut non excepturi et est ut eos fugiat cupiditate modi in odio ut rerum similique a rerum et quia facilis sit est dignissimos dolorem atque velit ut accusamus omnis delectus maiores occaecati alias atque et repellat saepe amet libero est