INSERT INTO `course_news` VALUES ('95', '5', 'Nobis facilis quia ex id sunt sunt.', 'Explicabo aut consectetur laudantium aut sunt temporibus voluptatem ab non praesentium perferendis maiores dolores ipsa omnis asperiores rerum et cum alias repudiandae maiores ut assumenda doloremque aspernatur in cumque rem accusamus expedita quod cum quibusdam aut quasi ut architecto veniam id unde itaque fugit laborum explicabo repellendus consequatur quia cum corporis est illum aut voluptas debitis in quo illo ex nihil facere explicabo aliquid dolore quis ullam debitis necessitatibus repellat autem esse officia architecto placeat qui ut possimus non quam quo ullam dolor vitae vitae et praesentium voluptas ut fuga eum quasi ad nulla et fugiat dolores nemo praesentium adipisci architecto aut consectetur non molestias sint laboriosam quia quam exercitationem voluptatibus iure esse eaque maiores nisi enim provident asperiores rem dolorum impedit quia fugiat laboriosam iure quam accusamus eligendi sit et et saepe commodi qui soluta harum et nihil impedit vel molestiae corrupti blanditiis et ut cupiditate odit amet quia voluptatem reiciendis quia sed deserunt ut cum laudantium unde unde et vel dolor dolores in pariatur molestias ut explicabo harum natus aut itaque eveniet est accusamus et aliquam non odio vitae molestiae nostrum sint sed qui facilis vitae enim sint laborum iure quo atque dolorem voluptatem aut voluptatum qui.', '0', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('96', '7', 'Eveniet quia sit qui officia quos voluptate.', 'Id neque quo quos quia dolorum vel voluptatum nisi et porro est dicta molestiae qui ut mollitia et suscipit sit dicta minus minima suscipit ipsum quo sunt facilis ea blanditiis quae nisi veritatis libero molestiae aliquid maxime omnis ad adipisci error maiores occaecati animi alias earum quo est recusandae officiis doloribus rerum dolorum et et tempore praesentium et repellendus et qui vel commodi dicta nam optio porro dicta unde dolorum ut ducimus ab tempora minima voluptatem et excepturi voluptatem ad enim perferendis vero labore animi expedita officiis in consectetur et libero sunt repellat qui ut odio sapiente rerum illum sunt sed et nihil assumenda quaerat aut dolore aspernatur deserunt nesciunt sint architecto incidunt fuga repellendus minus aut in non quam labore blanditiis sint commodi et dolores in neque fuga omnis optio quae dolorem non ex iure maxime nam qui suscipit a non nostrum recusandae modi consequatur non aut optio et odio perferendis quos ducimus soluta ut nostrum illum dolores magni reprehenderit atque ad mollitia vel sint consequatur culpa accusamus quibusdam dolorem harum sed dolorum itaque culpa nam eveniet voluptate neque modi neque eius temporibus qui quia dolores quo aspernatur quae illo non consequatur vero provident minus corporis quasi accusamus esse odio quia sed ratione vero temporibus dolores est qui placeat commodi ut sit explicabo rem provident sunt dolores quia aut non quia in corporis soluta necessitatibus sapiente facere rem est quia dolore ea ea quae ullam id voluptas magnam vero et aut similique vel alias pariatur ut id corrupti amet molestiae dolor aut rerum veritatis velit voluptatem molestiae provident sunt cum maiores autem architecto dolor inventore blanditiis et.', '1', '2017-05-02 22:58:47', '2017-05-02 22:58:47');
INSERT INTO `course_news` VALUES ('97', '1', 'Ducimus sed cumque temporibus ducimus est.', 'Beatae voluptas labore distinctio labore consectetur laudantium vel sint ut enim aut molestiae et qui non magni qui a cumque eum expedita sed et molestiae qui omnis voluptatem tempore et nobis voluptas dolorem exercitationem sit provident dolorem nesciunt officiis voluptatem vitae blanditiis voluptate quas eaque fugit aut qui et harum numquam sapiente voluptatem sunt consectetur id quo nulla in commodi maxime quos qui voluptatibus in rem quaerat temporibus sint qui impedit quaerat necessitatibus ab quis tempora quasi non sequi quod vel impedit excepturi et quae itaque sed blanditiis inventore omnis in ducimus enim dolorum est recusandae sint sequi quos vel voluptatibus non beatae architecto non sapiente quis modi autem incidunt dolores fugit a nesciunt sunt aperiam quibusdam iusto tempora qui quos perferendis qui aspernatur cum illo est cumque illum rem quae laudantium itaque rem quis natus culpa suscipit distinctio corrupti voluptas illum porro consectetur cupiditate quasi maiores eaque officia earum repudiandae alias reiciendis sunt dolorem esse ut nulla voluptatibus omnis quis est est et delectus nobis qui laboriosam dolorum est eum aut facere ipsum est esse repudiandae quam ipsum quisquam dolorem maiores aut id qui magni explicabo earum error distinctio voluptatem a provident asperiores sint qui dolor ratione doloremque consequatur laborum quia assumenda et quia in nihil quaerat perspiciatis cupiditate eveniet sit accusamus inventore ipsum quis aut in facilis sed aut dicta eius quae voluptatem aliquam consequuntur quaerat id culpa iste tempore quibusdam nulla voluptate nam ut similique sit et ipsam quibusdam dolores doloremque est assumenda delectus sint ullam sequi neque ut blanditiis ipsum sit ut exercitationem provident consectetur corporis veniam nam ad dolor fugit sed vel iste consequatur nam dolor soluta tempora porro sed eius eius recusandae esse illum omnis et aut