INSERT INTO `course_news` VALUES ('98', '8', 'Consequatur iste tempore ut consequatur est.', 'Modi harum quasi qui consequuntur et vitae eveniet et laudantium dolorem voluptatem qui impedit minus temporibus sit rerum ad vitae est voluptates voluptatibus qui illo rerum sed qui eveniet sunt omnis temporibus delectus maxime ratione repudiandae dolorum et repudiandae qui voluptatem alias laborum rem vel iure nemo quo assumenda distinctio sed voluptatem nihil recusandae quis eos mollitia corrupti dolores reiciendis eveniet natus accusamus tempore incidunt deserunt quia consectetur sequi id reprehenderit eum voluptatem excepturi sequi quia fugit doloremque aut aspernatur qui totam magnam architecto maxime tempore et maxime recusandae voluptas fugiat error magni blanditiis numquam culpa voluptas excepturi aut dolorem sit doloremque nihil neque quisquam sint ipsa ut et et consectetur odio ullam eaque dolor dolorum iure est officiis ut dignissimos ea illo neque laborum in repellat consectetur ratione beatae aut autem iste sapiente nihil numquam numquam qui ut et consequatur tempore maiores placeat voluptatem ratione dignissimos laudantium non accusamus aut ut et itaque asperiores dolor hic est consequuntur ea praesentium odio nesciunt quas et quidem qui ad molestiae qui neque soluta perferendis architecto et explicabo eveniet dolorem eveniet aut itaque mollitia facere quos ipsam quo suscipit architecto autem eius unde tenetur ab tenetur placeat eveniet sed odio dolorum ut fugiat rerum dignissimos et libero mollitia atque ut ut doloribus debitis in omnis quis quia debitis consequatur ducimus veniam ad aut nobis culpa velit aspernatur quas incidunt dolorum nemo officia velit et deleniti laboriosam quam sequi consequatur odit ratione esse nisi aut illo magni voluptates voluptate qui minima voluptatem placeat numquam ut atque sit possimus fuga rerum omnis et et illum est quia nobis expedita dolorum voluptas consequuntur at expedita iusto molestiae eaque facilis laborum molestiae