INSERT INTO `course_news` VALUES ('99', '10', 'Neque dolore eveniet aut a ut in corrupti.', 'Perferendis delectus earum eligendi provident ea sint voluptatem voluptates quo et id iusto harum at quidem quos itaque reiciendis neque asperiores incidunt rerum quaerat amet enim sunt maxime laudantium eligendi nisi eius commodi est sunt ullam explicabo aut sapiente distinctio rerum possimus iusto accusantium ut iste quia consequatur aperiam aut et et et nulla nostrum dolor itaque ut possimus tenetur perferendis non dolorem beatae aut sapiente quo officiis asperiores dicta et enim est dicta sed ex minus est officia molestias quidem non dolore aut illum reiciendis qui aut voluptate quod quia cupiditate at qui doloremque harum eos qui itaque tempore dolorem accusamus at enim sint sapiente magni velit adipisci adipisci est voluptatem doloremque illum velit aut neque qui iure odit quisquam fugit veritatis aut aperiam ea iure autem quod autem non est et facilis voluptas autem ut accusamus eos aperiam molestiae provident maxime delectus corporis aut rerum similique aut aut occaecati velit neque repellat delectus tempore ipsam velit consequuntur molestiae sed distinctio atque debitis iste illum vel illo libero id ut quidem maxime itaque excepturi officiis aut sit doloribus minus suscipit sint quis blanditiis nisi non amet id sit rem eligendi asperiores expedita optio harum architecto ratione adipisci sed illo voluptatem a qui voluptates ut eius vel quo consectetur perspiciatis ab doloremque molestiae necessitatibus in sint aut facilis animi soluta nulla eos dolor voluptas voluptatem nam laboriosam mollitia commodi nesciunt quidem non officiis quis ad quasi ut deserunt vel facilis quia ullam veniam ducimus ad provident quibusdam amet ducimus praesentium rerum ut ab unde repudiandae est quod in similique libero culpa voluptates et neque culpa neque aut sed aut ipsum necessitatibus sed sequi harum non ut ducimus sit sunt commodi hic libero saepe.', '0', '2017-05-02 22:58:48', '2017-