INSERT INTO `course_news` VALUES ('100', '7', 'In sed labore laborum quod reprehenderit.', 'Necessitatibus non voluptatem dolor nostrum doloribus enim cum illum maxime id nihil amet at dolorum dignissimos laudantium culpa laborum assumenda voluptatibus ullam laboriosam laboriosam similique vel earum minima ullam voluptatibus esse consectetur sequi ad quaerat perspiciatis vel voluptatibus qui quam laboriosam non tempore quisquam esse et assumenda soluta laborum voluptatem enim ea quia quod nobis totam labore distinctio sapiente beatae vel repudiandae reiciendis nesciunt non eveniet eum corporis repudiandae sequi blanditiis consequatur omnis autem sequi fugiat nesciunt temporibus natus dolores consectetur fuga asperiores minima ab commodi alias dolor consequatur iusto rerum unde omnis pariatur aspernatur molestiae aspernatur qui incidunt natus earum sed qui in perferendis dolorem ea maxime in sit velit vero sunt eum laudantium et quis est amet facilis nobis voluptas error quas nostrum aperiam natus autem deleniti non rem vitae ab modi atque ea odit itaque ipsum et laborum reiciendis commodi veritatis quas id eligendi unde dolores eius voluptate ea magnam aliquid ut voluptatem id et quia in omnis magnam voluptatum quia itaque dolores animi adipisci nobis blanditiis aut sit sequi et repudiandae veritatis eaque occaecati vero earum dignissimos eos corporis et vitae atque nemo voluptatem sapiente eveniet est et quia expedita nulla facere saepe accusamus fugit reprehenderit blanditiis rem sunt vel libero ipsum dolorem soluta nobis a odio omnis corrupti libero et nisi eum voluptatibus provident in molestias ducimus eos id blanditiis et consequuntur officiis enim hic fugiat minus in occaecati doloremque magni dolorum beatae et qui aut ullam excepturi optio consequatur qui eaque vel vel praesentium numquam enim temporibus dolor facere illum harum iste est eveniet ipsam accusamus pariatur voluptas est perferendis reiciendis tempora ut officiis sit non id dolor rerum delectus q