INSERT INTO `course_news` VALUES ('101', '2', 'Dicta ut id molestiae quia.', 'Quam odio ut odio vitae illo libero corrupti vel ipsa eius et amet doloremque numquam consequatur iusto ipsum optio non accusamus quasi quae eos ea sed omnis dolorem omnis quia quisquam eaque aut nihil voluptatem voluptatem non fugit consequatur aliquam molestias sint animi est et voluptatem earum quisquam hic itaque et dignissimos autem nulla assumenda aut neque iste quo ratione ut hic libero placeat dolorem ut eaque eius et neque provident mollitia animi ipsam est eos dicta adipisci voluptatem eum quis ea culpa tempore voluptate exercitationem quos suscipit facilis enim qui aliquam aspernatur aliquid est deserunt alias voluptas recusandae sequi ea qui error dolores cum voluptas aperiam sint cupiditate atque nobis porro quo possimus eum perspiciatis cumque ut distinctio ratione dolor tempora distinctio est pariatur aut eius dolores ut eum accusantium in cupiditate autem veniam ad odio fugiat atque cum ipsam fugiat esse earum hic ut sunt mollitia possimus qui ducimus eos voluptas doloribus impedit qui dolorem incidunt eveniet sed sapiente soluta dolores iste ipsum quo magni tenetur consequuntur sint quis quia vel sunt quibusdam at autem voluptate nobis possimus voluptatem et repellat magnam in qui a dolor placeat pariatur quaerat soluta sed distinctio maiores velit et qui iusto modi ea eligendi officia saepe quo est necessitatibus voluptatem dolores sunt enim nemo perspiciatis mollitia vel repellat et corrupti perferendis et quibusdam est dicta commodi dolorem dolore iusto et in repellendus sint sed voluptas placeat et aut sint esse repellat porro quisquam asperiores quia consequatur nihil voluptatem tenetur iste dolore voluptatem et voluptatem rerum odio ut sunt a sunt qui vitae ex placeat tempora est reprehenderit maiores non ab adipisci suscipit doloribus voluptatem aut voluptatum nesciunt et autem in nihil incidunt velit sint quo rerum qui consequatur labore non dolorem aliquam aut cor