voluptatibus rerum magni id asperiores consequatur saepe velit quisquam veniam neque blanditiis quos omnis consequuntur blanditiis et omnis ipsam enim doloribus voluptas fuga fugit.', '0', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('103', '2', 'Autem officiis voluptatibus tenetur rerum sint fugiat cupiditate.', 'Et odio amet quia reiciendis adipisci earum natus est laboriosam nam dolorum enim nam sit architecto modi autem sint saepe illo eum dicta sit amet rerum consequatur aut sed qui quia nobis assumenda aut omnis voluptatum maiores aliquid et officiis provident non qui ipsum dolor dolor dicta facilis quibusdam recusandae minima praesentium aut explicabo at provident illo cupiditate dolor doloribus corporis consectetur quia officia porro eos nisi reiciendis soluta eos fugit quia quis minima laudantium aspernatur incidunt doloribus amet consequatur qui dolorem optio provident illo neque voluptas numquam sunt qui fugiat dolorem libero amet neque voluptates voluptas quibusdam illum deserunt ab quia tempora repellat officia impedit ut repellendus deleniti soluta aut id tempora autem omnis quo sint aut minus ipsum ex voluptas in qui quo explicabo est molestiae voluptas quia et beatae porro saepe beatae quam inventore aliquid excepturi ab eius sed voluptas quidem autem quibusdam vero qui excepturi ea eligendi consequatur ut nesciunt exercitationem error quaerat ad qui molestiae qui et eos dolor atque et corrupti ullam praesentium temporibus fugit fugit pariatur distinctio numquam dignissimos aut sit rerum ipsam neque placeat dolorem rerum molestiae id officia illum cumque rem enim perferendis magni at dolores aliquam voluptas aliquid eius nihil aut minima vero autem fugit ut dolorum est dolor dolore consectetur eaque rerum voluptatem qui facere ducimus hic tenetur quis delectus aspernatur veniam dolor eveniet quae corrupti sequi rem consectetur dolorum adipisci ut reiciendis debitis aperiam accusamus qui qui nam sunt dolorem iure magni et inventore dolorem corrupti harum architecto sint placeat fugiat omnis quis quo qui sint delectus beatae libero et inventore necessitatibus sit sed pariatur quaerat dolorum cum ex sed minima itaque voluptate eligendi repellendus laborum consequuntur occaecati enim fugit rerum est quis neque optio nostrum recusandae similique aut corporis ex distinctio quia molestias enim nulla est cupiditate voluptate non incidunt ad ab expedita voluptates a sit iusto non numquam voluptatibus mollitia quisquam nihil voluptatum id nostrum unde quaerat modi autem distinctio inventore est laboriosam perferendis quia nostrum perspiciatis.', '1', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('104', '3', 'Nesciunt aut illo ut quasi numquam.', 'Adipisci numquam ipsam et laboriosam est quod ut dolor ut quaerat reprehenderit mollitia deserunt dolores aperiam molestias odio consequatur qui ea qui minima assumenda perferendis nihil saepe et repellendus veritatis molestiae quos non doloribus voluptas rerum aperiam nobis ad quis magnam enim consectetur placeat voluptates esse doloremque fuga placeat ipsa consequatur rerum rerum qui nobis et officiis cupiditate blanditiis sapiente enim voluptate voluptas reiciendis quo neque et sit eaque aspernatur dolorum in voluptas odio tempora officiis quas delectus doloribus rem quisquam ut tenetur quod vel nihil quas a distinctio distinctio non delectus necessitatibus ut enim dolor qui in rerum temporibus qui qui eum consequatur sapiente aspernatur exercitationem et similique occaecati doloremque sed mollitia error ea voluptas dolore nobis est enim sunt qui impedit qui asperiores maiores dolores error et consequatur quaerat sed quam fugit non sapiente rerum et veritatis quidem et est iste in quos ipsam laboriosam quos quibusdam asperiores et expedita saepe voluptas sed molestias voluptatum quisquam voluptates aut voluptas aut quia est qui tempore quis ea cupiditate eveniet labore cumque exercitationem labore consequuntur pariatur nemo quia ratione in assumenda a hic ipsa itaque omnis velit voluptatem excepturi pariatur odit ex omnis eos assumenda autem quia facere est quaerat a non quam exercitationem dolorem ipsum sit quas iusto corporis consequuntur dolor vero harum est possimus sunt similique animi iusto recusandae est et aspernatur similique error mollitia eveniet aspernatur sit veritatis qui tenetur modi perferendis quos eaque provident ea quo nostrum sequi voluptatem omnis quia id sit vero sint et quos qui necessitatibus laborum qui debitis est voluptas nesciunt eligendi numquam dicta ex incidunt deserunt et ut modi rem expedita ut animi perspiciatis tempora sunt ut qui nostrum et eu