INSERT INTO `course_news` VALUES ('105', '2', 'Ea qui ullam aut sunt omnis.', 'Illum vel delectus dolor soluta animi voluptatem similique inventore quam laborum vel qui quo est architecto a odit excepturi unde voluptatem sed delectus aut dolor exercitationem consectetur blanditiis iure aliquam modi qui qui nulla nostrum asperiores quidem porro est quod illum sit sapiente ut quam sint cumque exercitationem aliquid debitis voluptatibus aut omnis sit dicta qui sit nemo ducimus vel ut quaerat numquam accusantium dicta qui voluptatem sint et vitae iste incidunt culpa nesciunt odit ipsum eos libero magnam minus ipsa est magni ipsam tenetur culpa voluptate molestiae eos quam voluptatem distinctio quibusdam nulla velit alias doloremque rerum consectetur atque temporibus voluptates aut deleniti quod sed nobis et est repellat voluptate sed consequatur non autem tenetur non ipsam molestias autem laudantium repudiandae sunt aut omnis qui officiis et ut magni dolorem nam deserunt corporis mollitia similique voluptatem aut iure autem voluptas ex earum possimus qui ullam repellat ut dolorem labore corrupti laboriosam hic consequatur autem quia iure consequatur aut error voluptate nesciunt exercitationem veniam voluptatem cum cumque possimus occaecati ea similique accusantium suscipit ad laboriosam voluptatum ea alias molestiae sed dolorum quia quia est error laborum est deleniti sit molestias iure deserunt soluta aut aut totam id atque nihil iste et autem dolore odit eum saepe aut eum error suscipit ducimus sit debitis beatae et laborum laborum sunt aut quia nostrum voluptatibus placeat minima ratione accusantium porro expedita distinctio similique consectetur id quis similique perspiciatis dicta eos voluptatem ipsam rem atque et adipisci facere enim eveniet omnis praesentium voluptatem deleniti nobis nesciunt magni similique neque voluptas maxime molestias fugiat et et eaque officiis quae asperiores et sapiente et ut ut est qui ut quod dolor repellat sunt sapiente et dolores rerum ratione consequuntur vel exercitationem laborum facilis aliquam est velit sit ea tenetur dolor aliquam repudiandae ex at perspiciatis ut sint quia laborum quibusdam nesciunt dolorem quas rerum velit et fuga vero aliquam dolore praesentium molestiae id magnam dolorem nihil est incidunt qui sapiente est enim sint quia corrupti consequuntur enim veritatis non qui eum eum odit.', '0', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('106', '1', 'Enim quia voluptas similique officiis velit eum.', 'Vitae recusandae numquam eaque veritatis sapiente unde consequuntur natus ab et necessitatibus rerum quo voluptates temporibus consequatur ut et blanditiis ratione cupiditate quod explicabo laudantium nostrum perferendis odio in accusamus est iste ipsam quos est labore quisquam suscipit nihil et aut atque eius et dolorem esse quidem ad veritatis voluptate reprehenderit fugit veritatis est rerum fugit asperiores provident nulla ut excepturi fuga et et impedit consequuntur ipsam est recusandae ipsa ut et voluptatibus est vitae dolorem fuga sint hic magnam rerum expedita nesciunt maxime itaque et quasi qui dicta recusandae expedita consequatur quibusdam rerum commodi minus aliquid necessitatibus id ipsum nesciunt dolores vitae sequi suscipit expedita illo enim hic eum et ipsa ipsum possimus molestiae qui corporis tempora omnis sapiente quod ullam sunt non autem facilis distinctio provident aliquid ut omnis sit cum deserunt saepe nulla reiciendis dolorem aut nostrum dignissimos vel consequatur ipsa ducimus ex ut modi et doloremque fugiat sit quibusdam nisi inventore doloribus sit sit unde est placeat in quia nam voluptatem pariatur qui quos minima labore autem maxime consequatur repudiandae quis excepturi omnis rem ut autem placeat nobis provident impedit quaerat aspernatur exercitationem eligendi labore laborum et vero doloribus et et eos quas sint pariatur commodi aspernatur vel non impedit error repellat provident incidunt nemo sequi quos aut consequatur a doloremque omnis qui cupiditate eos error exercitationem tempore et deleniti rerum autem est aperiam eos optio doloremque nisi quia recusandae veritatis eum magni eos id in minima enim quia aut tempora qui commodi sint minima nisi quo sunt illo molestias facilis ut non quis aut assumenda qui aut voluptas fugit totam laborum sint exercitationem sed est dignissimos odit quod quia consequatur optio voluptas et voluptas expedita error consequatur culpa eligendi blanditiis sed voluptatem distinctio ut quis deserunt non sunt et voluptates voluptatibus animi suscipit quaerat ab totam nulla harum et aut voluptatem facilis qui omnis doloribus voluptatibus id quam aut sed omnis qui et aut et non at exercitationem commodi fuga et numquam nulla sed in est facere tenetur eligendi maxime provident voluptatibus cupiditate voluptate rerum eaque animi sunt rerum qui quidem et vel quo magnam autem non.', '1', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('107', '8', 'Temporibus fugiat non eligendi commodi.', 'Doloribus error fugit quisquam earum vel voluptatibus qui laboriosam repellendus numquam est ut itaque perspiciatis molestiae aut maiores praesentium blanditiis est consequatur nam aperiam nihil molestiae odit aut eum numquam tempore minus est impedit aut optio dignissimos id corrupti quia delectus maxime excepturi expedita iure quia quaerat rerum labore ab aut a amet neque sit velit et est molestiae sed deleniti libero numquam magni sint rerum deleniti iste commodi reprehenderit hic consequatur id accusantium voluptas ut magni est quod molestias et est dolorem asperiores qui qui in commodi repudiandae qui et aut provident recusandae aut eum quaerat et neque at odio quia a animi quo non culpa commodi consequatur dolorem earum eveniet enim dolores officiis quo perspiciatis tempora facere ullam quis ducimus quia ab quisquam ipsa iste non rem doloremque est asperiores ea quibusdam laborum nostrum similique et nulla sed dolorum debitis possimus ipsum repudiandae harum excepturi fuga itaque autem ullam ea vero totam autem dolores placeat voluptas voluptatibus dolorem rerum aut repellendus et est quidem eaque voluptatem quas sapiente quo inventore numquam expedita eum fugit doloremque ullam neque voluptas et aut exercitationem reprehenderit odit non minima doloribus molestias nesciunt sint at tempore quis pariatur qui dolorum et sunt quidem reprehenderit blanditiis accusamus sed sit quam beatae sapiente minima eveniet non officiis non perferendis pariatur nemo distinctio vel non sed provident sit facilis quia officia odit voluptas occaecati explicabo ipsam nemo vero et commodi rerum error in occaecati quia aut sit totam facilis eligendi autem sint quis occaecati nostrum distinctio itaque rerum eos fuga architecto natus consequatur qui voluptatem dolor inventore commodi ut ut quisquam velit cupiditate quia in eos sint dicta ut provident excepturi et ipsam adipisci voluptatem quis adipisci est quaerat velit voluptatibus odit temporibus recusandae quasi velit voluptatem enim beatae debitis et culpa reprehenderit aut illo eaque repudiandae aut in animi inventore voluptatem dolor esse neque asperiores.', '0', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('108', '7', 'Qui dolorem officiis asperiores doloribus voluptatem ipsa.', 'Sequi molestias autem non consequuntur vitae minima sapiente molestiae autem non et illo quo nihil voluptate veritatis ut ratione voluptate qui velit illum eum beatae voluptatum quia molestias molestiae commodi repellendus animi magnam debitis sed qui ut modi maxime et nam laboriosam voluptatum reprehenderit sed amet suscipit eaque quis est dolores distinctio voluptates ab deleniti corrupti hic praesentium corrupti repellendus ducimus qui accusantium quis laborum aut nobis nihil itaque et autem velit excepturi omnis doloribus fuga accusantium soluta et et dolorem magni eos assumenda aut sed omnis aspernatur sit pariatur aut quia ut dolores et occaecati fugit doloremque sapiente qui facere deleniti eaque vitae at quaerat et eligendi voluptatem nostrum fugit sunt dolor velit dolor blanditiis provident quam sed nostrum eos eaque veniam atque repudiandae ut ipsum quisquam architecto dolorem enim quo laborum nisi quasi iste dolores explicabo corrupti debitis eius quia consequatur repellat voluptate molestias recusandae molestias assumenda sit corporis consequatur incidunt dignissimos facilis id est commodi magnam exercitationem est sequi aspernatur blanditiis minima dignissimos libero possimus consequatur ex incidunt qui id et dicta esse nemo sit qui ut modi sunt excepturi vero ipsa ut nihil ut eaque et consequatur corrupti et et qui delectus ex nulla non commodi ab earum laborum maiores excepturi eum ut omnis esse veniam nihil molestiae cumque est temporibus excepturi amet voluptatibus quisquam occaecati explicabo consequatur vel ut non numquam animi a dolor distinctio atque dolore dolorem quisquam odio assumenda esse in et ipsam perferendis quasi temporibus veritatis eum totam quia.', '0', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('109', '10', 'Doloremque voluptatem facere et animi ea adipisci animi.', 'Quidem commodi quo libero nemo quia accusantium labore nesciunt et ea aliquid consequatur rerum accusantium dolor commodi sit repellat dolorem voluptas et dolor facere iusto hic ratione voluptatem at quis est nesciunt asperiores molestiae dolores rerum ut incidunt officiis fugit quia officia quaerat quia ut recusandae beatae voluptatem voluptas commodi maiores repellendus voluptas quibusdam labore tempora saepe tempore aperiam accusantium accusantium hic quisquam enim voluptatibus tenetur voluptatem aut eligendi dolore voluptatum praesentium repellat sed eum labore maxime accusamus illum aperiam explicabo debitis sequi sunt corrupti labore sapiente cum temporibus atque dolore commodi neque perferendis autem tempora pariatur dolores est eligendi quia ullam suscipit rerum placeat commodi rem voluptas cumque nesciunt ex impedit minus perferendis soluta quisquam commodi corrupti dignissimos ipsum numquam et sit fuga ipsam voluptates consequatur consequatur labore et veniam a magni quam voluptatem sunt commodi voluptatem rerum occaecati esse velit voluptas placeat error autem libero voluptates provident recusandae voluptatem sint beatae dolor ut ut rem dolor esse nostrum reprehenderit sequi reprehenderit voluptates corrupti pariatur iste provident dolorum ut repudiandae nihil voluptatem quos iste eos sed commodi alias et sed id odit ut earum perspiciatis cumque nobis tempore non quis mollitia sed facere nobis fugit corrupti ipsam totam dignissimos impedit quia omnis qui odio voluptas et et omnis velit vitae occaecati dolores eum aut in distinctio similique qui numquam laboriosam aut pariatur corporis ipsum qui consequatur eum rem et eveniet nam neque voluptatem hic minus temporibus aut in quia doloribus porro quaerat neque rem consequatur dolores odit esse accusamus quis sit doloremque officiis ipsa voluptatem omnis quia magnam ipsum est non magni recusandae vitae delectus iure cum odit fugiat fugit rem et numquam vel maiores ipsa amet excepturi sit nam voluptatem perferendis delectus error architecto est alias quos assumenda quis quasi est quibusdam aspernatur enim in iusto sint est inventore consequatur nisi consequuntur rerum possimus ullam aliquam fugiat dignissimos error natus voluptates maxime non a et quod culpa repudiandae id dolor eos doloremque porro quia inventore non fugit est sed dolores voluptatem quaerat aspernatur est amet occaecati ea dolorum voluptatem perspiciatis sed sunt quidem autem inventore porro aperiam non voluptatem et consectetur earum atque.', '0', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('110', '1', 'Rerum quis minima quasi modi.', 'Praesentium sint omnis asperiores voluptatibus consectetur cumque quibusdam qui veniam corporis hic minima incidunt sapiente deserunt necessitatibus illo incidunt dolor iste tempora fugiat praesentium sed rerum maxime velit amet accusamus sunt et quam dolorem dolore eaque ullam dicta aliquid vel iste veritatis cupiditate eos repudiandae quia sit dolores est temporibus deleniti voluptatibus sequi molestiae consequatur veniam culpa tempora dolores officiis eligendi nostrum repellendus fuga aliquid enim atque ut accusamus et harum perferendis sed magnam voluptatem aut hic non et expedita veritatis expedita fugit mollitia necessitatibus et reiciendis temporibus eum eius maiores reiciendis neque maiores qui eveniet officia nemo voluptatem ut quis distinctio quis eligendi corrupti odio sequi facere dolor maxime voluptatem similique quae qui illo sed quis odit officia rem quos illo dolore tempora voluptatum illo id fugiat culpa totam dolorem quo animi adipisci quaerat dolore alias nisi beatae doloremque tempora perferendis natus sed laborum molestiae non velit ullam omnis necessitatibus dolor sint molestiae voluptas atque perspiciatis officiis eveniet repellat non magnam aut quod sunt voluptatem est id inventore numquam id enim dolor pariatur magnam placeat dolorem omnis aut voluptatem id assumenda nesciunt eum id sint eveniet reiciendis placeat impedit vel necessitatibus qui est molestias culpa deserunt suscipit molestiae dignissimos aliquid iste quae ut magni praesentium ratione quasi consectetur quo eum natus et est esse qui nisi nemo labore quibusdam qui nihil necessitatibus labore quod sed odit et adipisci reiciendis nisi autem explicabo iste quia eum libero tempora ea quo laborum atque repudiandae sed accusamus id odit illo praesentium minus dolorem et quo aut voluptatibus non nihil cum qui explicabo atque quia sed voluptatibus sit soluta eius ut corporis labore magni sed voluptas et est non consequatur fugiat odit molestias sunt aut harum eos veritatis nam hic delectus fugiat non odit fugit eos ut aliquam voluptates et doloribus doloremque nihil et alias et id error omnis exercitationem sequi et soluta et itaque ut enim officiis molestiae molestiae hic numquam reprehenderit quisquam sed nam nihil et molestiae ad sunt libero maiores aliquam eligendi id nihil vero voluptatem voluptas nulla provident harum voluptatem incidunt fuga nulla ut ducimus qui a dolor similique unde atque atque rem enim qui quisquam et rem eius accusamus laudantium reprehenderit sequi qui explicabo aspernatur.', '1', '2017-05-02 22:58:48', '2017-05-02 22:58:48');
INSERT INTO `course_news` VALUES ('111', '5', 'Deserunt harum alias culpa nobis non.', 'Mollitia voluptate fuga officia blanditiis aut facere dolores ad est animi qui non quia dolores nostrum laborum cumque aut possimus sunt itaque iure odit corrupti mollitia vero laboriosam facilis qui dolores nihil ipsam delectus sed facere optio autem inventore aspernatur aut quo hic possimus quis at voluptatem odit eum et esse voluptatem ratione accusamus iure minima dolorum qui autem est magni qui deserunt consequuntur commodi quibusdam amet inventore dolores dignissimos veniam aperiam consectetur laborum facilis cupiditate magni ipsum culpa adipisci ut qui nihil dolorem accusamus adipisci perspiciatis dolores architecto voluptate aut et optio nostrum voluptatem reiciendis architecto ut facere eaque excepturi nihil rerum qui a temporibus quod sapiente voluptatum porro sapiente ut quaerat iste nostrum aliquid deserunt qui nihil sint quae harum sint blanditiis aliquam adipisci officia qui voluptate itaque ratione qui dolores eveniet commodi impedit facilis a eveniet laboriosam necessitatibus veniam similique rerum qui sunt tempora itaque rem aliquam repellendus quis non similique ad eius ut deleniti ut quo molestias natus sed qui repudiandae distinctio rerum omnis impedit iusto voluptatibus illum inventore iure quo necessitatibus molestiae quas ea nihil molestiae omnis consectetur magnam quibusdam sequi quis dolor illum nesciunt doloremque libero consequatur perspiciatis alias ut id et numquam quis repellendus quis accusamus cupiditate numquam rerum et sed molestiae sit molestias voluptates sit quisquam accusantium provident dolorem eaque et omnis accusantium et molestiae nam cum consequatur atque nesciunt dolor provident sunt earum et sunt itaque odit unde quaerat dicta qui doloremque sint mollitia consectetur debitis ipsum officiis pariatur qui culpa impedit qui rerum voluptatibus quia facilis adipisci voluptatem omnis dolor quia asperiores ut fugit qui sed suscipit dolorem voluptates vel debitis et ut maxime velit et voluptates voluptas doloribus nulla et maxime vel eos repudiandae omnis qui praesentium recusandae et consequatur amet laboriosam corporis ut doloribus eligendi repellendus expedita dolores quis enim perferendis harum at voluptatem officia voluptatem perspiciatis pariatur dolore unde eveniet et et occaecati eum quae molestiae vel sint doloremque debitis sit quia enim laudantium non facilis fugit a nobis est libero facere vel iusto rerum quo pariatur eum voluptatem maiores laborum doloremque culpa aut dolores temporibus inventore delectus ut dolore provident est ex sapiente saepe molestiae dignissimos quibusdam sequi et asperiores.', '1', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('112', '1', 'Eos asperiores quia minima ea.', 'Ad est ad iste quam tempore velit amet explicabo veniam id neque rerum et unde in suscipit aperiam eum consequatur illo quis voluptatem facere dolores explicabo nesciunt ducimus autem modi qui et at excepturi perferendis necessitatibus suscipit quae alias rem ut aliquam molestiae est vel repudiandae aliquid commodi corrupti eius quis vero quasi temporibus atque nulla aut aut veniam est praesentium quam quidem similique consequuntur quos dolor reiciendis modi voluptas nam odio illum eum ab doloribus quia harum saepe exercitationem illum vel et rem molestias quis ea delectus aut dolorum voluptatem explicabo accusamus quia molestiae esse ipsa ullam voluptates nisi sequi dicta aut et autem recusandae rem voluptas nesciunt dolores vel sunt qui odio rerum officia suscipit illo blanditiis aspernatur eius omnis sequi dolorem voluptas itaque explicabo quidem magnam et officiis eligendi voluptas voluptatem incidunt vel aliquid exercitationem facere dolorem vel accusantium blanditiis officiis qui tempora hic ipsam distinctio quod itaque dolores nulla sit voluptas doloremque amet sint ipsum fugiat sint id ad distinctio consequatur quisquam ipsam quo at sunt voluptatem id cum illum illum facilis rerum doloremque ut ut autem qui illum neque laboriosam sit cupiditate pariatur dicta doloremque dolores laudantium nobis minus beatae omnis aperiam quibusdam recusandae aut ad est doloribus sint molestiae illum consequatur ratione soluta aut sit debitis dolorem non molestiae in aliquam quo velit nihil molestiae consectetur et aut doloribus architecto laudantium corrupti ut voluptas odit iusto et et maiores sapiente aut officia et ut amet.', '0', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('113', '9', 'Ut et tenetur non illo.', 'Dicta veniam ut delectus vitae fuga eius quidem laboriosam dolores ratione et omnis voluptatem fugiat optio quis alias in nostrum sed id incidunt reiciendis est dolorem fugit corrupti facere tempora autem et id natus cum temporibus voluptatum excepturi maiores quia sequi vel qui at est qui accusantium ut enim repellat culpa eos quia sapiente vel labore non dignissimos nesciunt voluptas ratione quasi deserunt id praesentium ipsam vel inventore in eveniet qui illo accusamus omnis numquam non cumque debitis assumenda nobis dolores autem illum nam officiis doloremque recusandae sed hic dolorum ex dolores rem omnis autem ea est distinctio commodi deserunt voluptates veritatis id reprehenderit soluta repellat ea commodi qui asperiores harum facilis ut dolorem exercitationem possimus est odio doloremque hic est in perferendis error quo repudiandae perspiciatis qui animi qui voluptatem aliquam quo animi totam magni velit assumenda repellendus dolore ea voluptatem voluptatem incidunt ab cum beatae dolorem omnis impedit unde voluptatem doloribus harum ab accusantium quia officiis ex qui consequatur non molestias totam sunt et nihil dicta sit totam nostrum earum iure eum dolorum numquam fugiat amet perferendis necessitatibus perferendis voluptatibus sunt est veniam minus voluptates natus repellat fugiat sit et praesentium velit et autem adipisci autem rerum laboriosam occaecati ut consectetur laudantium id vel et itaque quam quos rem beatae ab accusamus non in sapiente quia non ratione quo id ullam et ut quas quo qui eaque aliquid dolores repellat porro sequi veritatis ab ad asperiores quasi enim voluptatem et veritatis animi exercitationem tenetur sed quidem eligendi accusamus rem magni molestias temporibus vel dolor ut autem corporis aut enim possimus sed quod dolor hic sint vel rerum et quia officia eligendi velit non est nihil.', '0', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('114', '5', 'Assumenda et itaque sunt reprehenderit debitis sequi.', 'Autem sapiente sit dolore velit fugit nisi nam dolorem error expedita totam molestias non sint doloremque temporibus quia natus et adipisci eaque accusamus dolor similique vero nihil deserunt est voluptatum rem cum et consequuntur sed ut impedit quia asperiores soluta consequuntur debitis unde amet non quae alias repellendus et quia natus et cumque non voluptas repellendus fugiat labore expedita numquam aut aliquam et qui quidem voluptatum fuga adipisci et veritatis ea aspernatur quia fugiat et adipisci laboriosam reiciendis excepturi provident ut velit ea iste et pariatur officiis aut incidunt dignissimos nam vel asperiores quisquam ut qui modi at odio quia voluptatibus odio et nihil sed aliquam eius praesentium minus aut aut eum tenetur blanditiis id nihil molestias occaecati molestiae velit quam quia doloribus iusto ab aut ut cumque earum aliquid sint magnam beatae ducimus ea facilis distinctio quasi dolor voluptatem ducimus id sit repellat autem consectetur ad sint aut eos deleniti sed aperiam quis quia quo rerum iste error incidunt ex illo et nihil cum voluptatibus a possimus itaque repellendus aut at similique commodi nesciunt repellendus neque fugiat repellendus enim natus minus consequuntur qui sunt quos et ut culpa debitis vero rerum corrupti eum soluta qui quisquam commodi odio id iste reprehenderit veritatis porro aperiam voluptate quasi est aut veniam eveniet repellendus laborum consequatur qui velit neque blanditiis officia magnam mollitia praesentium et soluta porro delectus assumenda consequuntur laborum culpa id sunt quibusdam voluptas consequatur quae harum recusandae libero et rem cum voluptatum voluptatibus assumenda exercitationem earum atque ipsam rerum assumenda corporis aliquid in aperiam pariatur maiores ipsum sit quaerat nihil alias vel ut incidunt atque optio ut aut est culpa sint sed quia aut aliquam adipisci corporis nobis optio consectetur ut fugiat amet perspiciatis quia qui quis dicta enim et non est ea magnam et adipisci sit reprehenderit veritatis perferendis quaerat voluptatibus rerum exercitationem aut quia ut tenetur non id porro ut.', '1', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('115', '4', 'Voluptatem exercitationem laboriosam recusandae impedit.', 'Fugiat est saepe cupiditate ut omnis saepe nulla aliquam iure suscipit quo aut enim fugit optio aperiam quia qui qui necessitatibus quis ab aut et blanditiis sint aut voluptatem ullam enim culpa pariatur inventore ut eveniet sequi molestiae qui vitae distinctio asperiores aut eaque quae ad cum expedita consectetur vel facere et sint temporibus cum illo aut odio tempora et maxime delectus libero sit qui ut voluptatem ab porro a consectetur adipisci et excepturi et optio voluptatem quas quae incidunt totam voluptatem et est libero at accusantium aut doloribus non qui dolorem et porro ullam explicabo et harum id aut molestiae aut non temporibus nam est libero excepturi est asperiores est beatae dolorem rerum asperiores animi omnis fuga doloremque et et aut ipsum sint dolorum quidem voluptas voluptate suscipit velit inventore sint quasi tenetur ut ex pariatur nisi et corporis possimus est quas harum deserunt exercitationem in possimus non quam praesentium ut magnam corporis velit tempore cupiditate incidunt est repellat sapiente sed magni facilis possimus et autem ut eum facilis modi aliquid et enim adipisci sequi aut tempora quis qui facilis deserunt et et laudantium ducimus qui dolor placeat est quia optio tenetur sit quia qui ipsa voluptatem iusto excepturi repellat ex omnis magni similique aliquid corporis sit non nam ut nostrum fugiat accusantium eius nesciunt autem recusandae alias nihil ut dolorum nostrum numquam vitae sunt distinctio ratione libero maiores ratione impedit consequatur ipsum in dolore tempore dicta cum quis inventore qui et qui inventore quis expedita et recusandae omnis et delectus vitae unde eum at ut nemo quaerat aut saepe a ea est illum delectus architecto eos accusamus amet facere dicta earum ducimus atque omnis aut delectus excepturi aut commodi aut expedita et ut architecto ut harum eum dolorem animi modi fugit omnis delectus tenetur suscipit eligendi suscipit officiis ut velit deserunt quia et iusto sint quo nam ad veritatis sed deserunt necessitatibus consequuntur eius qui maiores ut qui hic inventore eaque veniam dicta dolor ea laudantium similique tempore et ut est aut magni adipisci eum sunt laudantium aliquid dolorum ut qui vel impedit quia quo voluptas rem sed voluptates aut odio optio harum assumenda voluptatem quasi architecto cumque voluptas autem rerum culpa aut ut omnis rerum nihil rerum vel quo molestiae quis provident ut quo deserunt laborum suscipit expedita aliquam illum ullam eum omnis molestias iure magnam eum illo ducimus dolor rerum.', '0', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('116', '8', 'Perferendis repudiandae quos aut ducimus explicabo velit ad.', 'Debitis non esse et numquam aliquid voluptatem culpa nihil suscipit perspiciatis eligendi consequatur ipsum dolorem dolores est natus ea nulla veniam mollitia totam et mollitia ea molestiae enim voluptas quo facilis delectus vel facere quo voluptatum eos quas accusamus nobis atque excepturi et occaecati quis quod hic vero doloremque id aperiam consequatur et ab atque a id eos cum necessitatibus eos magnam maiores dignissimos labore consequatur ex sit quos quo commodi consequuntur iste impedit ullam omnis omnis eveniet reprehenderit voluptate delectus commodi quis velit ut est eum non id quasi quas iusto ut earum itaque ut nobis optio nobis at nam ut deserunt occaecati aliquid saepe quia fugit necessitatibus harum cum hic aut fugit ut dolorem tempora ullam et id quo culpa fuga voluptates qui ipsam commodi aut cum assumenda qui dolores dolor ab voluptas iste quo doloribus qui at sit sunt vitae est ut ab sunt dicta voluptas id expedita aliquid dolorem rerum maiores in necessitatibus pariatur molestiae est ea dolorem ut in quae nisi qui fugit labore nemo repudiandae asperiores enim voluptatem voluptatem sit consequatur nostrum atque architecto officiis est natus sunt nam occaecati aliquid et quae et veniam similique nulla distinctio ut ipsum ratione quidem voluptatibus amet et incidunt pariatur soluta labore dolorem corporis fugit maiores voluptate totam corrupti beatae est velit ea accusamus aliquam itaque et quia dolor aspernatur excepturi fuga et aut reiciendis corrupti vel reprehenderit cupiditate quam nostrum beatae repellat sunt cum consequatur odio iure.', '0', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('117', '1', 'Nihil delectus quia ut optio sint exercitationem est.', 'Aut possimus enim cupiditate qui non enim quam voluptas ipsum aspernatur facilis velit beatae assumenda est et iusto hic consequatur et eos est aliquam nihil at dolores voluptatem deserunt expedita perspiciatis autem pariatur rerum quidem deserunt et ea delectus harum molestias aut quibusdam aut earum et laborum autem ut vel molestias hic quis in voluptatem totam atque suscipit commodi tempore dolorem illo voluptatem ipsum eos numquam et aut blanditiis aut nihil dolores ipsam quidem eum consequatur eos quia eius quo fugiat fugit in autem laudantium magnam qui et exercitationem est necessitatibus sunt consequatur sed ex quae eligendi repellendus aut ut pariatur nobis eaque quos repellat ut modi non aut perferendis maxime qui dignissimos atque assumenda soluta voluptas assumenda et id est recusandae culpa architecto tempora qui hic repellendus commodi dolores facilis magni et itaque placeat laboriosam cupiditate ipsam aperiam voluptatem tempore enim aliquam et alias eveniet repellat qui nostrum quo amet qui non debitis cumque soluta itaque qui quos sed vel tempore et deleniti suscipit nostrum esse consectetur laudantium cum est debitis ea vel culpa dolore omnis autem accusantium porro est labore quae provident ut mollitia fuga nulla corrupti accusamus earum et consequatur sunt fugit quas voluptas voluptas ducimus omnis nulla nulla iste animi ut quos asperiores rem aut est magni quod ea et assumenda non nisi ullam repudiandae omnis eaque ex dolor est iste consequatur consequatur totam nihil aliquam deleniti in quo facilis dolore laborum sequi rerum tempora repudiandae temporibus rerum similique cupiditate quis quia et commodi architecto eaque et voluptas corrupti ut voluptates laborum sed ducimus qui provident sint voluptate molestiae rerum expedita qui odio quis sed molestias voluptatem cupiditate ducimus autem unde unde eos et officiis adipisci illo animi ullam dicta voluptas eos consequuntur et reiciendis assumenda veritatis in perspiciatis provident nihil et incidunt deleniti nemo consequuntur officiis aperiam eius iste molestiae quaerat tempore voluptas tenetur rem modi optio tempore officiis fuga animi alias et reiciendis consequatur eligendi dicta esse ipsam veritatis officiis ut totam similique qui nulla fugiat quas et quam quia eveniet alias nam aperiam ad officia voluptatem temporibus accusamus mollitia consequatur soluta vel cumque qui aut culpa odio dicta iure dolores omnis possimus optio rerum ipsa dolores est sapiente molestiae adipisci laudantium atque accusantium sit recusandae velit impedit iste error et numquam corrupti ex maxime deleniti sequi et qui quod totam consectetur est nam rem maxime id quam maiores ea dicta et labore eum minima quo nulla saepe quidem delectus eligendi sunt assumenda rerum sit magnam voluptate veniam quis qui magni quia minus autem at.', '1', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('118', '4', 'Dolorem repellat est aliquid eum.', 'Quod eius odio repellat quia sit sint consequatur vel eos quae occaecati est a voluptas quia ut est reprehenderit sunt quibusdam eos aut et vitae voluptatum facilis impedit dignissimos ab cum ipsum voluptatem sunt vero in ullam facere doloremque ipsum omnis sed corrupti sint ratione vero veniam alias quae officiis velit est rerum voluptates suscipit consequatur quas repellendus incidunt consequatur aperiam adipisci cum totam dolore aliquid et qui occaecati tempore natus pariatur illo voluptatibus ex adipisci ut assumenda sed et sed minima asperiores est ea eum odio et eligendi provident laudantium molestiae doloremque eum architecto et sunt iste est illum atque incidunt alias qui totam architecto omnis vel dolor vitae necessitatibus tempora doloribus excepturi aut magnam repudiandae laboriosam dolorum a sit dolorem et eveniet fugiat ea aut quidem reprehenderit nostrum nisi quo quis qui sit et saepe pariatur velit reiciendis blanditiis sapiente suscipit eius et maxime neque officiis et maiores qui et ut eum quia ut occaecati ut aut unde adipisci quo optio labore quia eligendi est amet adipisci corrupti placeat atque mollitia maxime in nulla nisi vel sapiente eum distinctio perspiciatis exercitationem ea omnis aliquid nihil distinctio optio rerum vero optio delectus voluptatum eos dicta eum at consequatur ipsa voluptates nihil cumque aliquid sapiente iure voluptatem placeat odio nisi qui voluptatum libero laboriosam tenetur rem architecto voluptas voluptates earum sapiente similique maiores aut officia cumque nulla impedit ea accusantium autem eum et qui aut dignissimos est eligendi fuga omnis maiores fugiat possimus ut facilis quaerat sapiente provident distinctio aut animi libero cum non est rerum aut dolor aliquid numquam est sed minima optio ea et aliquid voluptatem quo dicta nesciunt sed rerum eaque hic id voluptatem quia recusandae eius dolorem repellendus mollitia veniam consequ