INSERT INTO `course_news` VALUES ('119', '8', 'Voluptatem illo et laboriosam.', 'Assumenda in sit aut recusandae consequuntur eaque at qui molestias voluptatem quas nostrum soluta nulla molestiae ut repellendus voluptatem quia consequatur asperiores adipisci animi aut debitis quam temporibus voluptas atque consequatur dolores velit quae saepe dolores rerum distinctio ea asperiores voluptatem dolorem ducimus dolores labore repellat aspernatur similique qui incidunt ut et quod eum tenetur voluptatum doloribus officia dolorem sit minus odio et et cum sit et dolorum culpa odit ullam consequatur inventore aut vel nam quis sit vel earum hic non architecto distinctio ea eaque laboriosam sed dicta id unde et aperiam voluptatem itaque eveniet corrupti officia vero esse omnis ut sequi consequatur necessitatibus ea dignissimos vel qui ea ad qui qui nisi eaque a quia aperiam ducimus molestias sequi voluptatibus aut repellendus dicta qui omnis voluptatem doloremque in praesentium qui est est explicabo adipisci dicta provident illum tempore nemo et et eius adipisci veniam voluptatum ratione et dolorum neque et voluptatem aut praesentium unde natus suscipit temporibus aut accusantium aliquid sequi voluptatem amet aut sint expedita ea incidunt alias ea libero ex ea consequuntur magnam corrupti distinctio et velit rerum et ea inventore blanditiis sit quia aperiam molestias quia qui et quis eius sed voluptates tempore voluptas voluptates qui consectetur et suscipit beatae aliquid occaecati odit ea rerum sed dolores recusandae quia dignissimos quibusdam et quia eos enim molestias illo id assumenda quis id in enim voluptas sapiente eius temporibus et non omnis omnis blanditiis fugiat voluptatem quia voluptatem repellendus sunt architecto odit unde architecto maiores nisi quae similique quae qui vitae dolores inventore consequatur similique et sapiente maxime quo nisi laboriosam quia laboriosam itaque eaque consequuntur laboriosam sed ut ea inventore ut tenetur est perferendis facere su