INSERT INTO `course_news` VALUES ('120', '4', 'Hic voluptatum nemo velit vitae earum.', 'Et ducimus et dolor voluptas minus quod praesentium earum fugit est dolores quis aut natus nihil iste temporibus totam ipsam facere est molestiae quidem rerum esse quia rem est qui non incidunt aut hic quo placeat incidunt veritatis et sunt magnam et alias maiores ad quis consequuntur nulla est aut amet eum quos vel id perferendis doloremque aspernatur est tenetur est quam laborum porro asperiores sunt hic numquam est excepturi blanditiis commodi eius dicta et adipisci ea omnis officia modi earum voluptates sed provident officia placeat aut commodi soluta officia itaque soluta consequatur repudiandae dolorem eos ut consequatur et iure maiores facere minima fugiat enim esse facilis eum consequuntur delectus enim dolore sint iste magni labore quibusdam in commodi neque asperiores accusamus iste libero dolorem repellat beatae praesentium voluptatem ex inventore alias facilis exercitationem nemo quod quia rerum nostrum repellat nesciunt nobis necessitatibus nulla hic nisi quae sapiente qui et in et qui in nihil debitis odio nobis provident vel non quidem accusantium aut id veritatis vitae eaque quasi tenetur nihil dolore omnis dolores ut nesciunt ut quasi nesciunt voluptatum sequi quod esse quia doloribus quia harum sint suscipit corporis maiores ducimus rem ut deserunt atque et omnis possimus blanditiis cupiditate dolorum quo vero aspernatur aut sit facere voluptatem necessitatibus quisquam qui mollitia qui nulla sit quia est id blanditiis nostrum neque voluptate ipsa sunt et maiores et placeat sapiente est in exercitationem perspiciatis expedita non ducimus autem nesciunt accusantium modi ut culpa ut vero qui quia culpa incidunt voluptatibus dolores est eos id consequatur odio ullam voluptatum porro et temporibus debitis amet sit aut fugit voluptatibus quis quaerat et inventore dolorum iure non aliquam quo sed architecto atque ipsam non cumque unde reprehenderit accusantium ex et 