INSERT INTO `course_news` VALUES ('121', '5', 'Expedita et ea odit.', 'Aliquid ad tempore expedita sunt debitis quis est dolore ut ea ratione nobis consectetur commodi rerum id sapiente rerum et aliquam voluptatibus et molestiae laborum id minus vero omnis occaecati sapiente culpa numquam aspernatur adipisci ullam numquam quia occaecati odio ut magni odio aliquam minima ullam corporis consequatur nemo beatae incidunt magni aperiam possimus inventore ipsa consequuntur aut aut non officia quia iusto doloremque vero ducimus eos deserunt esse beatae quis maiores accusamus illum provident ducimus hic aliquam enim et magni eius occaecati sit harum accusamus quas voluptas tenetur ut delectus ut sapiente est sed illum amet distinctio porro repudiandae aut aut quisquam reprehenderit quibusdam rem vel iste at recusandae quam sed ut dolores veritatis accusamus ut dolorum adipisci iste reprehenderit quis quasi voluptatem quod quasi odit molestiae inventore sint facere quam aut asperiores excepturi veniam sint in eius consequatur veritatis et doloribus aperiam distinctio molestias placeat corrupti ipsa et aspernatur corporis laborum quia inventore voluptate optio sit sint est sequi enim exercitationem facilis quos tenetur iste qui cupiditate totam autem a aliquid quae eveniet occaecati non asperiores non repellendus officia occaecati enim ut vitae cumque reprehenderit nisi nam excepturi quis quam et aut non voluptas possimus minus quis quam blanditiis earum deserunt neque dolor omnis quisquam laudantium ullam dicta delectus quisquam non et omnis tempora quia et et eveniet et et libero dolorum vel dolores sed quibusdam commodi voluptatem magni aliquam nulla nihil tempore dicta doloremque quas molestiae est qui velit id et distinctio non consequatur qui commodi dolorem voluptatem aut consequuntur aut nesciunt architecto saepe dolorem totam et odit officia est velit cumque sed nisi sit quam voluptatem et sed aut sunt eius consectetur praesentium est eum consequatur quia eaque quia ad enim sapiente et ex corporis nostrum eos asperiores laboriosam eaque culpa dolores odit sunt nesciunt maiores quibusdam omnis sed magni quas velit dolorum consequatur est eveniet doloribus doloribus enim qui quo qui quos quis quo quia doloremque ipsam et sit rem minima veniam occaecati est optio magni explicabo sint amet deserunt unde fugiat earum quam eos facere officia voluptas ipsum ab numquam occaecati cumque ut est voluptatem et est incidunt quia enim unde fugit praesentium ut aliquam.', '1', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('122', '5', 'Mollitia nostrum et veritatis reprehenderit nemo.', 'Exercitationem porro officiis inventore nam laboriosam commodi et autem sequi quos recusandae consequatur ex porro repudiandae quas nulla accusamus non et voluptates perspiciatis voluptatum accusantium esse voluptatem deserunt quia vel necessitatibus consequatur qui aliquam porro labore sunt ea distinctio ea aut aut aut voluptates hic aut eos quasi rerum facere error sequi odit quis eos exercitationem est est optio dolores rerum et pariatur culpa sunt facere et aut ea ipsa occaecati possimus blanditiis qui quidem est fuga quae iure sapiente aut sed non excepturi aut nobis dolores dolores blanditiis assumenda veritatis fuga aut qui et eveniet quam tempora excepturi nemo et architecto consequatur neque placeat culpa quas quas iure modi voluptatem dolores id quasi voluptatem ut tenetur asperiores doloremque quo quo suscipit natus rerum molestiae quibusdam unde ad facere sequi tempore suscipit sed ab ipsam consectetur et nemo voluptatem magni officiis ipsum blanditiis quibusdam magnam corporis corrupti quis unde officiis enim molestias ut voluptatem dolore cumque quis laborum exercitationem corporis earum ut odio ut minima atque dolorem suscipit unde maxime officia illo enim excepturi sint enim vero sit commodi dicta amet odio voluptatem cupiditate velit sequi maxime sed dicta optio reiciendis optio perferendis explicabo nemo minus minus itaque omnis ullam et rerum doloremque error soluta veritatis ut est eaque aut voluptas corporis aut hic impedit ea voluptatem corrupti sunt maiores ut et a fugiat sequi magni et dignissimos esse quas rerum quia numquam hic maiores omnis non quidem quibusdam quibusdam nihil velit illo illum ut et labore nesciunt inventore cumque nihil corrupti dolores delectus cupiditate animi occaecati excepturi laudantium nesciunt velit ullam rerum accusamus est et velit magnam molestias placeat vel rem distinctio itaque ex velit veniam placeat nihil vo