INSERT INTO `course_news` VALUES ('123', '4', 'Ut expedita voluptatem et consequatur distinctio.', 'Eligendi suscipit ipsa nostrum praesentium tempora iste fugiat officiis doloremque et commodi illum itaque itaque voluptatem expedita qui qui odit quas officia enim est reprehenderit ad corrupti ipsa est totam architecto soluta sed ad aut iste dolorum consequuntur et eligendi architecto totam nihil blanditiis minima at perferendis aut dolor est nobis voluptate ipsa ipsam praesentium sit numquam natus laudantium sit quaerat ut reprehenderit qui ut exercitationem sit id molestias dolorum aut ipsa at quis esse sit ea illum quis ut culpa omnis et rerum voluptatem a et itaque eos provident necessitatibus qui sint eum quia inventore vel consequatur quia odio repellendus ipsa facilis eum aut fugiat odit enim corrupti et aliquid amet enim inventore dolore aperiam fugiat nam in sed nihil voluptatem aliquid incidunt et sit assumenda ad aliquid inventore eos amet aut alias nesciunt aliquid blanditiis doloribus tenetur ut odit occaecati aut harum veritatis odio iste unde eos laudantium animi architecto est sed mollitia odit velit consequatur odit non dolores eius deserunt accusantium et cupiditate repudiandae dolor provident aliquid laboriosam praesentium error qui excepturi unde iure cumque similique atque eligendi et est repellat non quisquam voluptatem qui odio voluptatum iste adipisci voluptatem totam ut laudantium omnis dolorem dignissimos numquam et reprehenderit.', '0', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
INSERT INTO `course_news` VALUES ('124', '6', 'Doloribus atque neque ipsam nobis nostrum voluptatem iusto.', 'Nobis dignissimos vel consectetur molestiae ipsum dolor ut quis molestias dolor tenetur quam fugit libero ea non quia quaerat libero quis dolor aut eaque nihil aut enim sequi inventore voluptatem reprehenderit voluptatibus ipsam quasi dicta impedit vel ipsa odio ducimus blanditiis at voluptatem sed ullam illum placeat enim dolorem voluptate laborum est cumque illum nemo vitae qui praesentium explicabo ut quam alias voluptatibus labore sunt dolor voluptatibus et rerum ut dignissimos est sed maxime magni omnis accusamus ea itaque id asperiores dolorum non quis neque maxime explicabo qui et qui porro totam deserunt ut aut exercitationem veniam quaerat ut debitis deserunt sit aliquam et nisi consequatur sed labore in eum dolorem alias quibusdam praesentium iusto voluptates ducimus dolores omnis voluptas officiis similique officia aut nisi rerum nulla rerum quas est voluptatem nesciunt maxime sed sunt adipisci vel minus voluptatibus voluptas aut quo quod veritatis quam exercitationem quo doloribus optio dolorem facere nostrum deleniti et debitis tenetur quo dolore aperiam omnis aut doloremque reiciendis sed hic fugiat dignissimos iusto amet et rem sint aperiam adipisci consequatur maiores quis voluptatem consequatur totam excepturi ad aut perferendis incidunt eos et quae suscipit voluptatem et ullam natus consequatur id omnis et dolore aliquam aut modi ut accusamus eveniet est libero doloremque itaque tempora cumque vero totam beatae vel ab delectus officiis laboriosam pariatur porro sit dicta eius quaerat ut possimus consequatur quae ratione eaque ea quas cupiditate excepturi officia aut explicabo dolorum dignissimos voluptate maxime ipsum maiores consectetur accusamus suscipit reprehenderit harum dolorem asperiores repellat soluta rerum aperiam omnis illum aut aperiam in nostrum quasi officiis nostrum quasi ad et voluptatem perferendis sunt mollitia sed velit p