INSERT INTO `course_news` VALUES ('125', '4', 'Esse delectus dicta magni et molestias quo doloribus.', 'Nobis mollitia odit nesciunt tempore ut ipsum iure totam perspiciatis esse aut omnis voluptas nulla ex labore dolor natus voluptatum quisquam ea tempora perferendis ipsa doloremque facilis vel et beatae illum eum recusandae quis inventore minus voluptas dolor nulla saepe ipsa minima possimus quisquam iure cum reiciendis corrupti sunt dolorum velit mollitia aut voluptatum ea minima delectus omnis quia cum numquam minus sit culpa voluptatem voluptates asperiores temporibus nulla et consequatur quas et aspernatur quia qui perferendis sequi quas nostrum voluptas ducimus voluptate omnis et atque voluptatem ipsam hic commodi doloremque quae corporis quis id aspernatur consectetur est quas rerum ea consequatur quibusdam repellat quisquam id exercitationem dolorem velit pariatur delectus quibusdam iste quasi quis minus quis adipisci voluptatem expedita et officia optio mollitia omnis inventore aliquam aut minus qui inventore similique est amet nisi labore non vel consequatur deleniti est molestiae voluptas consequuntur omnis molestiae expedita quis ea consequatur et odit libero dolorum excepturi labore quisquam a et rerum hic tempore eos eius laborum porro et qui illum fuga recusandae illum aut est ipsa a voluptatum in laborum tempore minus adipisci doloribus nesciunt placeat fugit dolorem velit laudantium voluptatem magni provident excepturi blanditiis aut hic voluptatem tenetur esse saepe vel voluptatem sint ut voluptas odit qui illo rerum est aut eum consequatur illum eum in rerum itaque aut id voluptatibus quos sunt et voluptas cum dignissimos delectus aut modi dolores itaque dolorum expedita totam molestias officiis ea perspiciatis doloribus est doloribus vel aut qui aliquam omnis omnis molestiae tempore amet esse magnam dolores numquam neque consequatur distinctio quas tempora aliquid dolorem fuga explicabo omnis omnis odio tempore asperiores similique qui amet dolo