INSERT INTO `course_news` VALUES ('126', '4', 'Quam sunt libero aspernatur eveniet sequi nobis et.', 'Fugit ratione aut doloribus voluptas sunt sunt voluptates similique aut doloremque in sapiente et qui quis porro ab sunt aliquid quod vel et dolores commodi quia natus ex saepe quaerat et tempora illo maiores quae facilis eum necessitatibus itaque officiis reprehenderit quasi tenetur totam aut eligendi animi eaque dignissimos ullam qui ullam exercitationem maxime molestiae deleniti itaque suscipit voluptas nihil aut laudantium quis nihil quasi corporis occaecati sequi autem quia aliquid veritatis sint fuga quae ipsa ut quidem vel explicabo quos nostrum maxime quibusdam voluptatem labore id sint officiis sed tempora rerum veritatis harum quibusdam quidem modi architecto commodi quia reiciendis tempora sunt eos maiores dignissimos animi facere quas corrupti fugit neque impedit occaecati eaque qui itaque tempora unde eligendi repudiandae perspiciatis libero voluptatem rem quasi non et sunt officia ipsum nesciunt inventore id neque necessitatibus laudantium voluptatem enim aut velit praesentium aut itaque nesciunt ex sed qui dolor et culpa enim eos sit libero similique praesentium similique aut accusamus est quia nesciunt ut enim vero animi ratione commodi et suscipit vel beatae impedit dolorem at doloremque nemo sed voluptatum ex animi nemo architecto excepturi saepe nostrum suscipit est incidunt illo modi eaque accusamus provident hic fuga beatae facere ad consequuntur consequatur et commodi quod similique maxime ab et commodi qui magni officiis est sit id voluptatem at reprehenderit vel sit magnam ratione corporis animi voluptatibus sed rerum sint quibusdam corporis earum ipsam mollitia vitae in itaque vel placeat praesentium voluptas.', '1', '2017-05-02 22:58:49', '2017-05-02 22:58:49');
