INSERT INTO `course_news` VALUES ('139', '3', 'Omnis blanditiis ex sit sed voluptatem nesciunt architecto.', 'Qui voluptatem qui vero veniam ea occaecati dolores voluptates voluptas delectus error voluptate magnam quas qui aut minima et et est vitae qui molestiae qui eaque magni tempore nihil qui qui magni qui quia placeat sed neque inventore enim voluptatem molestiae omnis facere reprehenderit ad eos corporis tempore quod voluptatem quo dolor aperiam voluptate et quos reprehenderit excepturi et quia illo aut nihil est qui ratione reprehenderit unde ab deleniti vero et dolorem voluptatibus ut veritatis praesentium eos unde beatae provident minima placeat in magni doloribus tenetur tempora possimus quidem consequatur alias culpa in ad veniam aut at sapiente et voluptas hic quidem et reiciendis voluptas animi qui soluta laborum maiores tempora magni ea laudantium sit rerum nisi qui iure aut consequatur aspernatur id enim repudiandae nam enim ducimus ipsa pariatur vel dolorum perspiciatis voluptatum animi nihil aut voluptas eaque vitae cupiditate ut aut aut aspernatur eos neque veniam porro dicta tempore omnis facilis quia consequatur eum et sit fugiat et magni quibusdam unde aperiam ipsam dicta animi non est mollitia hic dolorem laboriosam non molestias iste est vitae eum sapiente omnis at repudiandae quia est dolores iure in et aliquid voluptas nobis dicta odit quia et inventore cupiditate voluptate possimus adipisci incidunt eum doloremque voluptatem totam et enim voluptates ut.', '1', '2017-05-02 22:58:50', '2017-05-02 22:58:50');
INSERT INTO `course_news` VALUES ('140', '6', 'Non aperiam atque nihil quibusdam.', 'Ut omnis sed minus quia pariatur tempora velit autem repellat recusandae accusamus libero et consequatur rem a sapiente placeat dicta rerum enim nobis repellendus vel facilis sapiente consequatur non est fugit magni explicabo qui quaerat doloribus et natus omnis asperiores aut cum incidunt illum aut in ut omnis iusto nam vitae at amet quos modi quod fuga perferendis aperiam cumque assumenda non iusto soluta id consectetur sed eos aut quis dicta quod nemo qui aliquam laudantium incidunt voluptatem soluta voluptatibus et magnam mollitia et est et ea eos voluptatem quod laboriosam ad consequatur et voluptatem ut est eaque magnam tenetur ratione provident mollitia ab repudiandae in non veritatis qui quos ipsa et aperiam exercitationem mollitia aspernatur repudiandae aspernatur veniam sed qui sunt rerum aut ex voluptate soluta labore ea sed deserunt amet perspiciatis incidunt doloribus commodi totam qui cumque aut laborum et quidem molestiae quos accusamus labore deserunt et est odit deleniti unde rerum nihil sunt sit nihil repudiandae sed qui accusantium ullam et dolorum rerum veniam sint dolorem impedit sit est nihil enim itaque consequatur provident odio voluptatibus qui et sit consequuntur voluptatem officiis officiis est autem eius rerum non dolor ea impedit quasi error nesciunt est modi nisi quaerat tenetur et quia et dolores facilis aut quia voluptatem eum consectetur quia itaque voluptas in aut autem dolorem unde et perspiciatis voluptate et eius non molestiae illum facilis blanditiis voluptatem beatae placeat corrupti voluptas nihil voluptatum debitis eum consequatur et velit laborum expedita voluptatem iste quaerat vero quia est molestiae molestiae totam ut laudantium aut rerum qui neque nisi incidunt consequatur quod tempore nulla voluptate possimus excepturi vel tempora laboriosam possimus pariatur saepe aut soluta odio culpa soluta omnis ad et et accusamus qui at quo qui nos