INSERT INTO `course_news` VALUES ('144', '8', 'Debitis ipsam est explicabo enim corporis provident.', 'Magnam aliquam consequatur consectetur enim et perferendis beatae et reiciendis odio rem alias quibusdam sunt saepe dignissimos aut illo magnam a voluptatem nulla debitis facere aut dicta qui rerum rerum omnis quos non ut nam aut ea sed et omnis ratione et sint voluptatum soluta omnis et odio vero architecto qui corrupti nostrum minus eos quidem minus mollitia dolor hic est vel placeat ad incidunt blanditiis fuga placeat nihil omnis maiores earum libero aut quasi repellendus quia nam natus quae laborum unde ipsam repudiandae sit voluptas et nihil ducimus fugit et fuga aspernatur magni occaecati expedita accusamus accusamus sit delectus aliquam illum sed sed amet rerum exercitationem porro et quia occaecati ut iste doloremque nisi accusantium est expedita veritatis ea omnis nihil dolore facilis assumenda debitis molestias id corporis dolorum inventore qui illum ut dolores debitis soluta vero autem voluptas pariatur dolores velit ea odit quo suscipit velit in reiciendis consequatur quos sit molestiae architecto est illum dicta odio asperiores ipsum hic qui quia modi molestiae aperiam dolor aperiam qui pariatur sint voluptas consequuntur corrupti dolor amet recusandae eos autem corporis voluptate maiores dolor fuga quis porro dolores consequatur expedita ex qui hic iure adipisci aut dolores est cumque reiciendis quis deserunt quia numquam aut earum inventore deleniti consequatur libero tenetur numquam facere quis porro doloremque corporis et amet doloribus ut suscipit possimus consequatur quia nihil rerum corrupti facilis consequuntur saepe dolorem quia deleniti et.', '1', '2017-05-02 22:58:51', '2017-05-02 22:58:51');
INSERT INTO `course_news` VALUES ('145', '8', 'Porro eligendi eligendi tempore deserunt atque eveniet.', 'Repellat maxime voluptates inventore aut ducimus velit reiciendis quod officia molestiae voluptatem autem ut molestiae ratione alias libero ipsa nulla consequatur beatae nam non perspiciatis et tempore ut necessitatibus odio voluptates corrupti ducimus ab voluptas sunt molestiae blanditiis fugiat quasi et voluptatum deleniti non adipisci cumque est nostrum veniam quia eos itaque qui est dicta deleniti incidunt hic exercitationem voluptatem non accusantium repellendus quos veritatis non omnis eos et nobis velit sapiente voluptas perspiciatis exercitationem explicabo ut distinctio quia doloribus quia quia enim tempora molestiae sed iure nemo ratione veniam ullam debitis doloribus voluptatem voluptatum quasi neque exercitationem quo velit corrupti enim maxime dolorem quae quo vero est perspiciatis hic expedita voluptates dolore totam quod unde quos laudantium et dolore quia recusandae voluptas officia in cumque voluptatem quam quaerat animi labore quis officiis praesentium et aut sunt cumque voluptatem vel veniam et sit suscipit facere asperiores ut et facere ut aspernatur nostrum atque facilis magni iusto sit voluptatibus eligendi aut recusandae voluptatem maxime autem ipsam ea sed earum sunt exercitationem sint soluta corporis corporis ut ut optio inventore harum ratione dolorem sunt maxime accusantium esse voluptatem et ipsa rerum beatae dolores rerum velit.', '1', '2017-05-02 22:58:51', '2017-05-02 22:58:51');
