INSERT INTO `course_news` VALUES ('147', '5', 'Et illo temporibus et assumenda doloribus.', 'Quod consequatur expedita dolorum atque laboriosam facere minus illum neque ipsam ipsum sint quisquam maiores aut accusamus accusantium aliquam quia dicta laboriosam debitis saepe id laboriosam nisi voluptatem itaque sit quia non magni voluptas neque est ut aliquam neque quia veniam officiis corporis quis ut pariatur magni libero ratione laborum vero soluta nemo explicabo ratione nisi voluptatem sed sapiente qui quod et qui molestiae nostrum et eligendi reiciendis asperiores voluptatem et voluptatem voluptatem ipsam voluptas qui nihil saepe dignissimos tempore ab rerum et culpa neque sed sint unde corporis neque facere odio hic et quis placeat et alias atque rerum illum possimus sunt quia nemo ut consequatur autem quos et ea sit et temporibus qui ea sit nobis autem qui totam dolor laboriosam explicabo delectus dolorem qui fugiat nulla dolor unde qui et dolorem est maxime enim sed dignissimos ea quo inventore voluptate ratione sapiente atque aperiam deserunt delectus quia voluptates quasi facilis veritatis a minima exercitationem rerum ea possimus natus at ex soluta cum dignissimos nesciunt nobis sapiente soluta officia dolorum adipisci temporibus dolores tempore repudiandae consequatur magni a ea non odio debitis qui dolores doloribus quos ex rerum doloribus eos corrupti ducimus ratione nostrum voluptatem error qui consectetur sint enim ullam in sed nostrum temporibus dignissimos ut perspiciatis id neque in in et eos impedit aperiam soluta commodi aliquam magnam quisquam aperiam optio impedit temporibus culpa voluptatem rem maiores soluta mollitia facere fuga laboriosam maxime amet quam velit sed exercitationem fuga quam nam quo ipsam cum cupiditate magnam mollitia repellat recusandae ratione quod magnam maxime non eaque maiores libero a neque ipsa eos rerum et sunt voluptatem quibusdam sit et fugit et voluptatibus quis placeat provident ratione sequi libero blanditiis nesci