INSERT INTO `course_news` VALUES ('148', '2', 'Voluptatibus reprehenderit similique ut ipsam cum dolorum aut.', 'Voluptatem officia nihil hic incidunt consequatur excepturi quos deleniti ducimus reprehenderit accusamus dolorem asperiores quas atque non voluptates et laboriosam facilis aut et illo omnis velit ducimus quaerat odit aut et rerum laborum totam voluptatem placeat esse dolor cum iure dicta est minima rem dolores fuga delectus nemo et illo deserunt quam id dolores voluptas et eius quo minus dignissimos a ut dolor nobis provident fugit quo eos error et vel itaque blanditiis aspernatur distinctio sint ut eum reprehenderit libero ut consequuntur voluptatum non expedita quidem architecto velit inventore sunt vel quisquam sed deleniti qui corporis sint inventore sint hic repellat commodi sunt suscipit quod omnis sit deleniti repellendus eius omnis quae fugit voluptatibus voluptatem repellat id natus et amet error perferendis animi et eaque natus ea aut sapiente nesciunt vel ut id inventore omnis consequatur quis aut sunt sit quos doloremque voluptatum dolore porro qui occaecati illo sit cumque repellendus et omnis id quas nihil eius quia laboriosam ut velit id qui officia vel dolorem aliquid laborum vel quasi natus aut ipsam nemo nesciunt excepturi accusantium neque nesciunt amet libero ut sit reiciendis dolorem nihil non necessitatibus sunt placeat distinctio consequuntur ullam quam ut dolorem nam totam ab autem sapiente dolores ut consequuntur qui exercitationem similique quia ut cumque officia velit dolore ut omnis inventore voluptatem saepe facere quam maiores necessitatibus dolorum distinctio accusamus doloribus numquam excepturi porro ut sed perspiciatis minus delectus debitis dolorem eum fugiat consectetur aliquam aut eius tempora non nobis sit ipsa dolorem et vitae doloribus rerum architecto aspernatur harum rerum beatae hic eum sequi voluptates fugit non exercitationem dolores quas maxime sit occaecati ratione nisi eum qui laborum odit beatae odit nulla