INSERT INTO `course_news` VALUES ('149', '3', 'Sit rerum nihil tempora.', 'Est alias et sit error enim architecto aut consequatur et at ut rerum quis repellat atque illum sit quia quae culpa aut ipsam excepturi nam omnis voluptatum facilis libero sapiente earum aliquam accusamus odit ut culpa aliquam tempore autem dolores aliquam accusamus optio id consequatur a qui facere qui quo et fugit dolores et impedit nihil possimus sit earum omnis esse ducimus voluptatum eum tenetur illo voluptas architecto magni omnis est earum doloribus accusamus ut sit molestiae nam unde eaque dolorem occaecati esse et cupiditate consequatur voluptatem consequuntur dolor doloribus asperiores similique aut odio libero nihil accusantium voluptas sit perferendis soluta ut similique sed ducimus esse non voluptatem sunt eveniet qui officia ut inventore aut omnis voluptate illo non qui maiores dolore dicta minima commodi molestias consectetur rem adipisci soluta voluptas rerum et tempora aspernatur aperiam et dolor ut sint ea repudiandae aut modi mollitia cum quas occaecati qui soluta possimus vitae aperiam ut in similique ut alias recusandae eligendi blanditiis amet non sed maxime id debitis cumque eos praesentium reprehenderit pariatur perspiciatis mollitia voluptatem necessitatibus sed non vel aut vitae dolores non reprehenderit quis voluptatem vel sed sint unde accusantium ipsum est eos sint aut error commodi voluptatem quis incidunt architecto nisi ratione quas laudantium magnam quibusdam odit impedit consequatur unde ex ad eveniet fugit est debitis dolor earum voluptates exercitationem natus unde velit corrupti qui eius numquam inventore occaecati quia vitae quod ratione facere autem dignissimos labore saepe eaque quaerat eum cupiditate temporibus quis similique sequi nobis quibusdam consequatur quae pariatur animi est rerum tempore dolores fugiat natus veniam ut error quod odio consequatur et aliquam at ut laudantium voluptate eius et dolor esse consequatur voluptas nihil et sapiente rep