INSERT INTO `course_news` VALUES ('150', '5', 'Aut cumque sint nemo voluptate illo dicta est iusto.', 'Illo qui dolorum animi est iste ad officia expedita dolores aliquid ducimus animi eum nemo vel rem accusamus labore aut ex magni temporibus sed molestiae et cumque ducimus quam enim eos minima officiis voluptatum debitis explicabo dolorum autem repellat quia ipsa aut at non quia sunt voluptas enim sed nihil commodi minus similique similique accusamus tempora amet sunt illo doloremque possimus dolore et et delectus quasi omnis culpa exercitationem ipsum sunt dolor ratione officiis accusantium illo consectetur sequi provident suscipit eos sint sed ut et non quo et in eos a provident vitae qui iste ab facere quisquam enim animi fugiat dolore voluptatem atque eveniet omnis id iusto est qui nesciunt asperiores facilis incidunt esse nemo culpa animi et rem ad et sint repellendus qui rerum error non ab assumenda eaque est eveniet maxime quia eligendi eaque quia ut occaecati consequatur quia voluptatum provident maxime laudantium blanditiis suscipit eveniet quo quas occaecati ea quo omnis et voluptatem et ex provident quia veniam omnis fugit possimus et perspiciatis qui sit aut aut cumque laboriosam illum expedita nisi in quis dolore est eos voluptatum nulla cum nihil occaecati reprehenderit neque voluptas ut totam qui quae voluptatibus error magnam fugiat ea sint est odio velit aut illum optio reiciendis incidunt voluptas animi aut sint ut soluta voluptas quo accusamus est qui quas aspernatur non ut nam id ipsam id quae dolores a qui quidem sapiente et magni non occaecati quia veritatis voluptatibus ullam minima sint voluptate aperiam qui qui molestiae ut quisquam dolorem cumque et sunt dolorem nisi delectus voluptatem aut veniam quia perferendis praesentium alias dignissimos porro odio fugit tempora aut tempore nisi ipsa qui voluptatum aut dolor ea exercitationem sed non similique eligendi voluptatem laborum vitae nostrum debitis vel non provident ab suscipit impedit eum