INSERT INTO `course_news` VALUES ('151', '6', 'Dolores iusto praesentium est a iure maxime.', 'Aperiam et id ut animi vel unde et maiores nesciunt et quibusdam dolor cum saepe quia voluptatum quis quasi sapiente corporis provident dolorem ut sapiente nobis sit ducimus neque ut hic quibusdam quo qui vero aut dolor ab quia perferendis qui qui voluptate saepe et velit sed non ut aliquid a ut optio cumque in enim perferendis at iure placeat facere et quod debitis illo temporibus tempore ipsam autem voluptas ipsam nihil enim a qui occaecati cum veniam et ipsam temporibus aut voluptatem animi culpa perferendis aperiam impedit voluptatibus velit ipsam voluptas natus tenetur sint dolores quas voluptatem aut voluptatibus accusantium est aliquam exercitationem cumque nesciunt sequi necessitatibus in praesentium reiciendis facilis reiciendis error dolor eligendi sunt ea quis soluta quia nisi sed odit tempore sit cupiditate sunt ea et assumenda distinctio et et eum perspiciatis autem minus sequi aut magnam est provident qui eos quod pariatur eum omnis aperiam doloremque molestiae pariatur aut voluptatem dolore commodi voluptate facilis cupiditate pariatur sit reiciendis eum aut omnis vel vel a consequuntur fugiat modi qui ut vel vitae omnis amet asperiores inventore autem eos repellat in ratione et tempora sed velit voluptatibus nesciunt et et ut maxime veritatis aut quis dolores vel minima rem qui eum fugiat est eligendi sed eos omnis ad quis dolorum dolorem doloremque debitis sint magnam tempore et quas et occaecati eaque maiores aliquam et recusandae architecto cumque corporis enim vero est sint voluptate beatae sint sunt illo inventore illo aut aperiam a vitae odit numquam deserunt voluptates quo adipisci iusto nisi perspiciatis doloribus voluptas nihil dicta in tempora odio praesentium aperiam qui praesentium et unde ipsum nesciunt ut rerum commodi rerum ut ut qui cum quibusdam deserunt adipisci veritatis et consequatur adipisci rem est soluta voluptatum aut quae non ut na