INSERT INTO `course_news` VALUES ('152', '3', 'Reprehenderit et quia sit sint ad est.', 'Laborum enim voluptate qui debitis saepe iste voluptatem similique fugiat aut quia quis accusantium consequatur quos sunt ducimus eum exercitationem maiores officiis voluptatem qui placeat nostrum sint corporis beatae fugiat quia est eos quisquam iusto doloribus ea nostrum sint consequatur saepe illo enim cupiditate laudantium qui repudiandae facere officiis reprehenderit quis voluptas ut voluptatem molestiae ut tempore molestiae saepe officia odit deserunt quis assumenda ea dolores sit rem nemo distinctio qui voluptate quo ducimus et pariatur hic magni maiores cupiditate quo et aut nobis dolores ut explicabo voluptatibus ipsum praesentium dolorem facere aperiam est id placeat unde aut optio totam voluptatem in vero saepe qui ullam temporibus dolorem eveniet eaque error qui ut qui enim expedita sint id veniam unde rerum nam dolor similique deserunt molestias rem non facere nihil dignissimos beatae id facilis sed mollitia provident optio ab numquam iste adipisci fuga aliquam harum eos eos exercitationem modi quia in laudantium in rerum veniam rerum dolor impedit autem unde dolores quia eum aperiam eum dicta tenetur ex ut repellat veniam sunt exercitationem tempore repellat et modi fuga dolorem impedit quod illum doloribus provident accusantium et sunt eaque voluptatem non voluptas et magni dicta eos voluptas quasi nostrum quis vitae eum dolorem voluptatem quis et voluptatem rerum incidunt eos id nisi est recusandae alias enim praesentium porro ullam rerum nobis fugiat aut corporis accusantium est rem tempore quo deserunt debitis non est et ratione et quaerat laboriosam delectus laudantium minus quasi nostrum et voluptatem voluptatem natus cupiditate dolorem rerum sint adipisci ex voluptas animi nostrum rerum est facilis esse animi quam error et natus velit rerum laudantium odio dolore deleniti quae et quisquam ipsum qui sit id qui impedit quisquam atque consequatur qui repudianda