INSERT INTO `course_news` VALUES ('153', '6', 'Aut et ab aperiam vel dolor.', 'Aut vitae asperiores hic magni officiis quod harum deleniti tempore cum soluta laudantium ratione iste praesentium deserunt ab distinctio omnis necessitatibus consequuntur veritatis aut voluptatem molestias natus enim labore libero nisi nam quasi inventore et et ab dolorem deleniti natus est dolorem culpa suscipit eum numquam voluptatem suscipit aut qui vero sed quia deleniti aut dolores molestiae dolores omnis mollitia accusantium molestiae et et quidem maiores dignissimos excepturi fuga omnis est quo corporis magni eaque unde facere dolorem et est quia et dolor sint in incidunt cumque aspernatur illo aut nam itaque veritatis nam dolorem maxime dolore autem expedita est vero tenetur laudantium assumenda magni suscipit sit dolores quaerat corrupti dolores laborum aspernatur qui consequatur distinctio saepe omnis accusamus natus aut velit numquam laborum quis qui ullam voluptas est sit aut voluptatibus distinctio voluptatem et cupiditate ut impedit deleniti cumque repellendus possimus et eos placeat enim vitae expedita ut possimus molestiae minus nulla esse cum qui error esse blanditiis voluptatem quo esse voluptatem facilis quia esse accusantium est dolorem odio quo deserunt in consequuntur provident dolorem et fugit recusandae nesciunt praesentium molestiae aliquid est ab sed odit molestiae exercitationem impedit qui eaque officia delectus in quibusdam facere repellendus error autem quia rerum deleniti assumenda culpa placeat consequuntur in aut illum sint in sapiente delectus dolorum voluptatem qui quasi et laboriosam modi natus in mollitia quo atque eum sed enim sint accusamus cupiditate adipisci debitis ut aspernatur vel exercitationem unde facilis a unde quo unde delectus quia et non ipsam ut rerum facilis voluptatem omnis numquam aut quasi quia ad ipsa iure est ex quis exercitationem cum nesciunt accusamus dolores molestiae dolorem enim eos qui illum dolor nihil est doloremque neces