INSERT INTO `course_news` VALUES ('154', '7', 'Rerum dolor necessitatibus explicabo et.', 'Ipsum et id sunt temporibus earum quas et debitis est voluptas molestiae eaque doloribus labore odio nihil ut cum laboriosam qui inventore laudantium fuga unde et veritatis explicabo iusto maiores rerum accusantium quas sed aut similique consequatur harum ut quidem velit non natus ipsam dolor deserunt perferendis qui eaque optio magni velit beatae dolor atque eos itaque aut molestiae atque qui ab dicta hic minus et consequatur veritatis quod eius voluptas est recusandae ab est quae ea alias quisquam et architecto reiciendis tempore iusto consequatur animi doloribus ipsa dolore molestiae et expedita non vel consectetur tenetur accusantium dolor ut occaecati eos sapiente autem consequuntur molestiae id quidem veniam officiis praesentium doloribus praesentium blanditiis reiciendis dolorem libero nulla nesciunt beatae corrupti est eveniet consequatur blanditiis sapiente natus quia quos architecto quos corrupti et pariatur quibusdam voluptatem veniam voluptas error deleniti ratione dolor voluptatum laudantium illum magni molestiae perspiciatis qui sequi similique esse quis tempora aut recusandae neque odit qui atque velit ullam deleniti blanditiis consequuntur rerum fugiat et sed et soluta velit debitis sit assumenda ea nam molestias consectetur ullam qui accusantium sunt dignissimos hic aut deserunt dolores aspernatur eos quia quia expedita et omnis dolores molestias modi aspernatur blanditiis consequatur voluptatem nisi aut dignissimos omnis distinctio enim ducimus facere id perspiciatis architecto est rerum quam soluta eos odio voluptas voluptatem dolorem est aspernatur et quidem quisquam alias quasi sunt et id est quis et voluptates sapiente possimus earum molestiae est vel est debitis necessitatibus ipsa hic quasi voluptas eos inventore a accusamus nihil aperiam est in et porro enim quia dolores praesentium velit quia culpa laboriosam sit consequatur aperiam molestiae consequu