INSERT INTO `course_news` VALUES ('155', '10', 'Saepe doloremque sequi harum id excepturi eligendi sint asperiores.', 'Distinctio aut voluptate dolores alias atque debitis cupiditate dolorum qui porro molestiae esse quidem qui dolorem dolores perferendis quia sunt modi quidem nulla velit rerum vel qui alias aut ut sint est consectetur dolore sunt consequuntur sit nulla rerum qui excepturi eum omnis est enim magni blanditiis occaecati nulla ut esse rerum quaerat et consequatur saepe et sint repellat magnam ratione consequatur autem culpa eos quaerat facilis quaerat aut commodi tempore numquam eligendi saepe in sunt perspiciatis hic rerum soluta sed rerum iure assumenda quidem eum dolorum et voluptates eum beatae et omnis eum quia magni fugit natus vel alias eligendi ipsa ullam nam asperiores earum consequatur animi ipsam in consequuntur et ducimus amet id sint itaque enim officiis labore sequi sed hic molestiae fugit sapiente eos reprehenderit possimus nisi aut illum voluptas asperiores quis odit expedita et nemo facere aliquam sunt voluptas totam tenetur praesentium amet occaecati enim ex natus id voluptatum quo dignissimos eos fuga nihil consequatur tempore perspiciatis ducimus soluta nam quia ea consequatur placeat animi velit accusantium sed qui vero sed repellat deserunt aut accusamus corporis id tempore quod voluptatem adipisci ut accusantium debitis aut tempora beatae nemo itaque dolor ducimus officia asperiores ea et possimus omnis quo occaecati eum est laborum repellat porro natus quae iste error debitis perspiciatis similique eius impedit vitae at omnis quo ex est est aut quos et in unde quaerat corrupti assumenda dolore rerum molestiae est tempore libero at alias cumque accusamus et odit temporibus omnis quis commodi impedit dolor a non facilis laudantium repellat quia.', '1', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('156', '1', 'Sit labore omnis dolores qui.', 'Tempore inventore consequatur aperiam dolor eum praesentium sed ipsum veritatis voluptatem esse sit beatae eum fugiat molestias porro aut cum reiciendis distinctio rem iste tenetur veniam aut est et esse maiores nesciunt qui magni at ipsa ut reprehenderit sit architecto debitis magnam distinctio quisquam similique modi eum nihil inventore distinctio beatae eos ut aut velit et consectetur inventore aliquid molestiae incidunt temporibus quis iusto odio rerum maiores est sit mollitia itaque voluptatem alias nostrum velit ut a est quia exercitationem est magni quo optio minima placeat tempora doloremque aperiam omnis aut molestiae doloribus non voluptatibus officia rerum non nobis explicabo itaque officia aut velit sint voluptatibus recusandae cupiditate temporibus voluptas officia sint iste nihil possimus blanditiis omnis laudantium assumenda qui voluptatum quaerat consequatur rerum rerum quis ipsam nisi vero qui vel dicta sapiente quae molestiae sed deserunt placeat nisi est nostrum fuga qui ducimus reiciendis voluptas voluptatem provident molestiae dolores vel illo sunt libero consequatur mollitia amet recusandae dolorem voluptatem sint amet sapiente quia animi dicta consequatur voluptatem et et et consectetur officia magni fugiat sunt maiores modi voluptas voluptate hic rerum totam porro cumque minima eveniet eius nisi nam omnis esse blanditiis commodi nihil quisquam perspiciatis qui et ipsam error qui dolores vel saepe quod est ab consequatur fugit aspernatur porro consequatur molestiae et officia sit autem quidem ea fuga beatae ea et et nostrum consectetur voluptatem vel tenetur sed eum blanditiis nam labore totam nostrum laboriosam earum ut qui architecto minima assumenda debitis pariatur asperiores.', '0', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('157', '3', 'Omnis dolorem vero commodi et.', 'Vel ipsam quos necessitatibus eum molestiae tenetur et tempora cupiditate blanditiis et et sint neque voluptatibus sit odio et ex a quis molestias vel in rerum fugiat rerum suscipit expedita similique libero quo aperiam aspernatur delectus est tempore veritatis aperiam veritatis et ullam id esse voluptate omnis quidem distinctio consequatur mollitia vitae illo quisquam quia deleniti provident iure autem assumenda dicta nam unde sunt aut et quia ut dolores quia ab debitis earum porro rerum dolore beatae nisi voluptas alias voluptates voluptatibus reprehenderit amet incidunt ab dolor vitae ipsum odit corporis minus vero ea cumque eius a quis fugit quas dolor sit sequi sint nulla iste earum voluptatem quo non delectus nulla quod praesentium nobis architecto voluptatibus voluptatem earum ullam nisi minima inventore libero nesciunt similique quisquam praesentium et dolores aut aspernatur error omnis est reiciendis doloremque sint rerum deleniti id harum vel veniam debitis officiis dolorem enim illum in eum ut dignissimos ea id eligendi vel explicabo perspiciatis provident qui ut sed laudantium id iure omnis quisquam ducimus dolorum doloremque non et reprehenderit totam soluta amet veniam illum aut cumque aspernatur at similique quia optio recusandae sit repellendus libero molestiae nam a minima eum vel laudantium eveniet rerum fugiat repellendus et illum id quaerat qui doloribus ea nihil consequuntur quibusdam eos maxime voluptas fuga ut eos sapiente commodi cumque non et consequuntur dolorem exercitationem sit velit rerum atque quis repellendus ipsa omnis blanditiis maiores et vel possimus tempore suscipit veritatis consequatur eum laudantium voluptas eum dolorum asperiores nemo voluptates voluptatibus perferendis et rem soluta dignissimos iste sed qui reiciendis qui incidunt nam aliquid itaque inventore rerum et id ex consequatur sint sunt ab voluptatem ex rem quod consequatur deserunt dol