INSERT INTO `course_news` VALUES ('158', '6', 'Aspernatur neque eum explicabo nesciunt et voluptates maxime.', 'Perferendis sint incidunt aliquam quos alias soluta impedit ut similique itaque repellendus eum fuga aliquid deserunt consequatur similique ab commodi natus excepturi et a ducimus aperiam excepturi tempora neque alias reiciendis possimus ex quia hic aliquid dolore quos nihil animi laborum veniam iusto nostrum voluptatem maxime eos recusandae perspiciatis qui distinctio quam nam rerum maxime ad est voluptates aut et pariatur ratione repudiandae voluptates ut illum doloremque molestiae delectus quasi aut voluptatem autem quo repudiandae incidunt nulla rerum eius tempore quis ullam officiis provident ullam cumque rem architecto deleniti maiores eum temporibus quia voluptatem vel molestiae exercitationem officia beatae sit harum repudiandae sed voluptate eaque vel voluptatibus non error doloremque dignissimos nam maxime vero aspernatur qui quae eum eius sapiente quia id id odio provident consequuntur ducimus debitis similique doloremque aut qui eos blanditiis voluptas et voluptatem molestias sit aliquam sunt et eum sint sint reiciendis odit ut voluptatum sed iure enim sed quis adipisci blanditiis culpa dolor maiores qui omnis sint libero consequatur nemo aut eaque sunt nihil aspernatur quidem et et excepturi in rem rerum id vel nam non tempore velit esse consequatur fugit distinctio beatae molestiae voluptas numquam a voluptas et dolorem quidem nostrum eaque voluptates sit deleniti explicabo provident eveniet et ex veniam unde in minus voluptate assumenda aliquid quas nobis sed quaerat expedita facilis odit tempore voluptatibus pariatur at exercitationem earum eius cum voluptas voluptas culpa et reprehenderit architecto facere qui aut enim molestiae quas illum cum dolor odit molestiae et autem et adipisci nulla hic cupiditate qui dolores non molestias reiciendis alias ullam nesciunt dolore rerum error quae illo rerum et mollitia quidem cum assumenda rem nesciu