INSERT INTO `course_news` VALUES ('159', '6', 'Est est repellat consequatur cupiditate dolor.', 'Doloremque rerum sed odit voluptate cupiditate ex sunt laboriosam in laudantium deleniti debitis reiciendis earum nihil porro magni neque minima totam voluptate optio qui rerum mollitia odit cupiditate ea voluptates doloremque nesciunt non in at quidem voluptatum quia saepe rem quas hic sunt est delectus placeat voluptas consequuntur ducimus accusamus occaecati ex quia labore deserunt voluptas et tempore magni sed deleniti minus rem dolorum praesentium fuga quasi sit eius ut dolores inventore quis et aperiam est ipsum rerum qui dolor minima enim autem aut sit similique officia quam distinctio fugiat ut et unde sequi veritatis dignissimos at qui enim eos eaque fugiat quis iusto alias quibusdam et accusamus numquam quia omnis maiores repudiandae inventore dolores ut omnis facere cumque minus ipsum sit culpa maiores esse quia omnis iusto dignissimos consequatur assumenda maxime mollitia repellendus nihil ut illo veniam dolores consectetur est et sequi maxime numquam quasi in vitae dolores non neque consequuntur reprehenderit illo esse voluptatem quia molestiae commodi odit fugit nostrum et dolor cupiditate culpa quidem tempore reprehenderit at impedit magni laborum distinctio neque voluptate voluptatem eum qui nulla omnis ut libero qui maxime dolores assumenda quis maiores quia repellat sunt ipsa eligendi voluptatem omnis sit in doloribus repudiandae autem unde sed possimus illo sed et quis quae voluptatibus et omnis excepturi quisquam a consectetur et aliquid veniam soluta error dolorum repellat quae beatae et consequatur asperiores in sed rerum illum fugiat earum quo consequatur nihil sit commodi sed harum voluptatum illo molestias necessitatibus ex consequatur hic eius dolor laudantium mollitia illo pariatur id magni dolor dolor tenetur aut voluptatibus aut et deleniti excepturi ut modi quaerat perferendis blanditiis qui ut assumenda quos autem quia veniam et libero repe