INSERT INTO `course_news` VALUES ('160', '5', 'Magnam et enim minus quis sit est natus minima.', 'Saepe qui veritatis maiores molestiae quos enim laboriosam et nam molestiae et consequatur iure ad quia et ut aut iste corrupti aut repellat vel et cum non dicta incidunt amet consequatur voluptas placeat optio asperiores rerum tenetur perferendis dolorem voluptatum tempora hic error illo sed et culpa nulla sapiente totam eligendi et a quis quidem sit unde cum enim blanditiis quos aliquam nesciunt neque totam libero dolorem expedita quia mollitia ad illum et cumque dolor sed at fuga et quia ut et voluptate similique pariatur est quasi et molestiae nam rerum dolor asperiores nisi unde ipsam doloribus rem voluptatem iste nostrum esse nam assumenda assumenda blanditiis aut pariatur vel rem sunt illo quo dicta officiis quae error ipsam laudantium exercitationem numquam consequatur eos voluptas porro qui eos voluptate consectetur recusandae et aut quos dolor officia autem alias dolores in consequatur officia ipsum rerum illo nostrum voluptas perferendis iure at velit voluptatem blanditiis delectus rerum dolorem et magni ex aut voluptatum pariatur dolorum repellendus autem a tenetur consequatur placeat qui est recusandae eius unde magnam voluptas incidunt quod alias consequuntur molestiae optio debitis ad dolor eos voluptates perferendis deleniti officiis est cum eos pariatur debitis nam et ex quia nostrum natus atque commodi quaerat hic commodi et inventore distinctio magnam adipisci dolores qui ut quisquam dolorem suscipit rerum sed nihil unde autem voluptatibus minima consequatur aliquam est quas in dicta molestiae dicta voluptate ex dolore voluptas debitis voluptas quo dolorem commodi sed vitae et perspiciatis voluptatem et at provident est eius aut error animi dolorem laboriosam itaque velit quasi error esse est nesciunt similique non ut dolor id sapiente incidunt alias sit cupiditate quia temporibus ut ipsum quae voluptatibus rerum nobis qui earum cum ipsum explicabo el