INSERT INTO `course_news` VALUES ('161', '4', 'Harum explicabo qui odio non dolorem fugiat iure.', 'Ea molestiae laudantium quia incidunt et deserunt labore cumque quae deleniti eum suscipit natus blanditiis quia ratione sunt non architecto minima quas ea fugiat ut autem aut et voluptates dignissimos modi nihil quam eaque ab rerum nam vel enim ut labore vel illo qui non reprehenderit labore vero suscipit ut omnis quia facere quidem nihil aut eum aliquid nisi maxime ipsam eos aut voluptatem et sed asperiores mollitia molestiae minima voluptatem et quia non laboriosam ducimus debitis voluptas ut accusamus eos eos est voluptatibus et aut minus tempore quam eos provident quam quo explicabo rerum accusantium quia at est ad molestiae id ut officia expedita modi molestiae veritatis nobis provident placeat est dolorem ut ut est iure quaerat ut maiores est animi autem esse sed laudantium quaerat libero vel eligendi consequatur vero eligendi suscipit et beatae illo quo asperiores autem voluptate maxime molestiae architecto eligendi quod et dolores voluptatem enim incidunt officia ut cupiditate voluptatem occaecati et voluptatem enim quia reprehenderit eligendi rerum enim recusandae tempora reiciendis velit quis vero eos quia molestiae temporibus beatae dolorem est fugit atque laudantium voluptatem qui velit magni et dolorum nostrum illo perferendis nihil optio enim asperiores doloribus adipisci fuga impedit velit omnis suscipit repudiandae incidunt sint earum nam dolorum ut et et aliquam minus deleniti at aut quidem quae qui aut aut porro accusamus autem provident velit nisi maiores autem asperiores qui aut totam tenetur placeat aut repudiandae corrupti enim dicta et iusto suscipit mollitia qui et earum rerum modi mollitia enim facere quis cupiditate sunt aut consequuntur numquam minus placeat commodi ipsa nostrum laudantium est ab voluptatem id vero inventore voluptas atque at corporis quisquam occaecati aut ipsa aspernatur consequatur praesentium et iure perspiciatis fuga c