INSERT INTO `course_news` VALUES ('162', '1', 'Alias id modi neque veritatis mollitia.', 'Quam nemo omnis officia ipsa ut commodi ea soluta delectus nostrum ut velit animi earum dolorum iure repudiandae quisquam officia minus dolores neque aut architecto sequi quos quis ea natus temporibus aut et temporibus eos architecto eveniet possimus quas aliquid debitis totam dolor eos odio doloribus et ipsam perferendis iste est illum quod porro sint ad iure amet quas consequuntur et necessitatibus sed molestiae quod et voluptatem et cumque recusandae dolore odit officia aut laborum cum quis quis dolorem nihil assumenda rerum ducimus sapiente culpa tenetur impedit et totam ipsum fuga ea dolor nihil ipsum voluptas voluptatem id similique eum earum ex similique rerum similique vel ut aut sit rerum sint omnis dolore velit labore est animi omnis aut voluptatum illum voluptatem eveniet ut ut rem fugiat qui voluptatem repellat occaecati recusandae nam facere voluptatem laboriosam quod cupiditate assumenda corrupti consequuntur aliquam totam sed pariatur perferendis repellendus sapiente quia iure sapiente ex officia recusandae non commodi fugit expedita rerum hic quia eum aspernatur id rem temporibus sequi deleniti saepe illo quia sed id molestiae cupiditate ducimus at quo nam dolorum saepe ut est quia voluptatem ut soluta earum iure voluptates est qui molestias sit aut sit vel voluptas voluptatibus hic illo ut iste voluptatibus veniam totam modi aut ut molestias et dolores quia asperiores doloribus magnam architecto pariatur eveniet facilis similique consequuntur minima voluptatem aut doloremque et voluptas rerum delectus neque odit voluptatem consectetur maiores omnis soluta quisquam rerum debitis dolorem modi accusamus unde id dolorem perferendis quis odit quidem sint repudiandae exercitationem ab fugiat nemo facilis provident sunt expedita aut libero.', '1', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('163', '9', 'Itaque ea voluptatem quidem magnam voluptatum.', 'Et quis voluptatem eos explicabo nisi maiores expedita qui itaque odio neque quia tempora asperiores blanditiis impedit facere deleniti nemo modi ipsum quidem modi beatae esse sunt veniam omnis tempore ea pariatur recusandae cum recusandae esse beatae laborum consequatur voluptate perspiciatis magnam est voluptate quod voluptatem sequi non ad rem illum voluptatem veniam corrupti quae porro et perspiciatis qui totam et molestiae enim voluptatum repellendus nemo quam amet fugiat qui accusantium enim voluptas similique maiores illo non dicta culpa et in itaque nesciunt illo sunt recusandae repellat laboriosam velit possimus voluptates expedita sunt rem a non consequatur rerum enim unde porro id molestiae consequuntur voluptas labore quo modi fugiat sit officiis sit aut tenetur est recusandae est laboriosam magnam qui culpa non ex vero eaque molestiae sunt rerum numquam error molestiae molestias non blanditiis provident minima impedit consequuntur quaerat rerum dolorem et fuga enim maiores sint sunt voluptates a impedit voluptatum laboriosam voluptas esse aut eos iste quia est provident beatae ad aut autem voluptas omnis pariatur quae omnis error laborum minus quia occaecati rerum sequi voluptatem in excepturi nihil veritatis soluta iusto quod voluptatem amet at aut odit cumque unde ut sequi amet repellat voluptas labore sed ea maxime quo vel officiis hic animi porro sed ipsum vero illum minus earum omnis architecto sit quia aut molestias veritatis est omnis possimus necessitatibus reprehenderit molestias vel animi et quae qui ut eum iusto non delectus culpa sed rem delectus harum omnis dicta est modi iste itaque impedit autem fugiat repellendus sit nulla beatae.', '0', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('164', '9', 'Ratione at sed dolores minima quas hic voluptas.', 'Omnis exercitationem quos eveniet assumenda illum fugit consequatur quia voluptatem in eos et ut est officia commodi aut quia id porro iste maiores eos consequatur totam eius libero laboriosam mollitia dolorem sunt illo autem rerum quasi animi aut quis porro est quibusdam ea sit sunt rerum ducimus veritatis harum aliquam rem sunt architecto similique eum quisquam vel enim qui laborum natus voluptate eligendi ipsum quia ad pariatur soluta quidem nihil ipsum autem eum vel cum labore ratione officiis iure omnis magnam ullam rerum non sed dolorem et sint at aliquam repellendus quia ipsa placeat dolor consequatur cum veniam qui labore quae perferendis doloribus accusamus repellat ut possimus aut ut alias aut repellat quod sed dolor fugit et quis et sit accusamus veritatis et temporibus doloribus aut est et nisi numquam voluptate et veniam ullam omnis maxime aut rerum ipsa ea eveniet ea commodi placeat tenetur velit accusantium esse animi dolorem nihil placeat quis voluptatem beatae nobis tempora autem tempore aut sit quaerat et vero dolorum odit omnis commodi explicabo hic et facere unde qui ducimus dolores voluptatem commodi fugiat ab aut harum corrupti at eos nihil similique facere aliquid ea aut delectus enim et voluptas at nulla quia voluptate voluptate placeat asperiores soluta qui nisi cumque corrupti fuga impedit ea ut quasi dolor mollitia et nam consequuntur impedit laboriosam est laborum ex reiciendis vel ad magni perferendis delectus consequatur aut aut aut eos officia alias fugit minima pariatur ut accusamus quasi est quia cumque minima ad et itaque aliquid doloribus natus aut quidem temporibus enim ea aut nesciunt laborum sed molestiae omnis quisquam ex ducimus dolore rerum voluptate quo nemo voluptatem quasi dignissimos dolore et vero et dolor esse similique qui quibusdam velit sequi sunt sequi molestiae qui hic vel qui quibusdam est aliquam molestiae quo iusto