INSERT INTO `course_news` VALUES ('165', '10', 'Velit optio cupiditate fuga id vel culpa aliquam.', 'Amet sint perferendis voluptates molestiae sint eum temporibus enim commodi voluptatum et magni quia necessitatibus et necessitatibus numquam praesentium tenetur et sunt similique doloribus et architecto nobis ut corporis quaerat dolores modi deserunt tenetur corrupti commodi quidem quod sunt optio quos ut aliquam molestiae impedit dicta facilis perspiciatis provident quisquam minus qui dolores sit iste veritatis iste qui explicabo impedit optio nesciunt maiores quae esse repellendus non necessitatibus voluptatem aperiam iste ad facere fugiat reiciendis magnam et beatae nihil voluptatem dolor dolorem non sit error doloribus quo ut neque ea enim sequi sed quia voluptates consequatur repudiandae ea dolore itaque explicabo consectetur porro vero veniam quam impedit porro eaque doloribus cupiditate error adipisci tempora qui est ut aut maiores quod excepturi distinctio velit corrupti sit aliquam quisquam distinctio qui et est eveniet ut est quia facilis repellat et iure in beatae dolores magni et sunt quis et accusantium qui sit et culpa voluptatibus ipsa enim labore ipsa ut veritatis et velit voluptate omnis debitis qui laborum deleniti voluptatibus reprehenderit consequuntur eum dolorem et quia ipsum aut modi quod nobis quo minus deserunt fuga similique explicabo expedita officia possimus est quia et consequuntur fugiat atque qui sunt ut repellendus voluptatem laudantium nemo delectus debitis voluptatum nisi perferendis sit perferendis ab sint consequuntur quisquam soluta nisi nulla ratione possimus provident culpa aliquid nihil molestias adipisci quis perferendis ducimus cum commodi voluptatem repudiandae rerum deleniti dolorem aliquam praesentium suscipit temporibus velit molestiae officia libero consectetur pariatur inventore modi soluta inventore quia facilis tempora velit doloremque est aliquam iusto sed velit dolorum occaecati quo rerum expedita ipsam sint magni 