INSERT INTO `course_news` VALUES ('166', '1', 'Saepe quibusdam eum esse sed a aliquam voluptatem.', 'Harum ut tempora eveniet laboriosam deserunt iure magnam quo dolor ut architecto temporibus quo expedita quisquam quo molestias omnis qui eaque eaque repellendus nulla alias quisquam illum possimus dicta voluptatibus eos eveniet exercitationem corrupti tempore laudantium laboriosam natus ad minus velit rerum minima in voluptatem commodi eaque minima autem vel est enim reiciendis autem velit voluptatum aperiam iure autem eligendi et voluptas omnis ab deleniti ipsum soluta omnis deserunt dolor dolores distinctio et consequatur sit consequatur aspernatur libero error eum assumenda veniam voluptas autem dolores ea quidem dignissimos est inventore nemo deserunt veniam possimus adipisci in inventore incidunt in sit voluptatem velit pariatur molestias esse soluta voluptatem dolores harum animi aut reprehenderit quam temporibus nesciunt sit iste non voluptate est fuga non odit dignissimos vel et molestiae officia quia similique maxime placeat ducimus qui beatae voluptate aperiam ipsum quidem enim dolor inventore praesentium eius hic enim ratione molestiae et minima saepe iste ullam commodi dolores modi et est aperiam praesentium et enim mollitia qui minima maxime et vero dolores et magnam recusandae expedita ullam sed temporibus in nihil aliquam fugiat rerum dolor a velit voluptatum aut soluta nulla expedita numquam quo voluptatem assumenda officia delectus enim quia omnis sapiente sint asperiores assumenda et voluptas adipisci odit temporibus voluptas omnis amet nemo ipsam et consequuntur architecto saepe et aliquam quas libero rerum aut voluptatem eos minus minus ipsa quis quo tempore repudiandae accusamus ratione id commodi maxime mollitia impedit aliquid ab cumque aliquid hic natus doloremque repudiandae esse quia dolorem exercitationem voluptatum repellat voluptas fuga ipsum adipisci repellendus tenetur ipsa sunt et facere praesentium quaerat nulla tempora in accusamus 