INSERT INTO `course_news` VALUES ('167', '6', 'Tempora beatae esse distinctio et fuga.', 'Alias molestiae quis vero ea nulla ea omnis voluptatem corporis aut quod ea nobis illo corrupti neque quidem voluptate architecto vel quidem ut voluptatem iste rerum possimus perspiciatis alias soluta quo delectus iure facilis quo ut architecto provident animi omnis eveniet excepturi voluptatum illo similique sint ut ut voluptatibus qui sit maxime velit praesentium autem non ut sequi modi officia dolores et officia iure eveniet qui adipisci labore eligendi voluptas a accusamus est culpa quasi ut rerum sint nihil sapiente nam sunt facere odio maxime quo quam dicta reprehenderit nihil veritatis quia non sed sit esse minima aliquid magnam vero nihil magnam quia esse accusamus ut eum deleniti quod quia nihil ipsam qui quis repellat aut eligendi architecto veritatis necessitatibus omnis eaque omnis et sit temporibus alias recusandae odit nihil impedit dolorum qui suscipit ut saepe eos harum voluptatum exercitationem sed magni sint voluptatibus sint non nemo perferendis illum voluptatem dolores dolores alias nihil debitis consequatur nemo maxime est sunt accusantium laudantium molestias repudiandae qui mollitia recusandae eum hic ipsam soluta beatae consequuntur assumenda qui non dolore sunt tempora quis quis laborum voluptatem voluptas harum ea soluta quod et vel nihil optio veritatis omnis amet officiis ut odit blanditiis explicabo et aut consequatur consectetur reiciendis quas voluptas repellat omnis maxime ut et eum tempora dolorem quisquam fugit molestias doloribus ad vel est delectus inventore labore et excepturi omnis quidem beatae sunt consequuntur dolor odio voluptas incidunt voluptas vero enim magnam blanditiis possimus totam dolorem cumque voluptatem sed blanditiis sunt sit autem error iure autem debitis molestiae veniam voluptatem ea explicabo voluptas non quo nihil culpa tempore tempore itaque officia rerum est earum voluptates dignissimos sunt optio dolore laboriosam do