INSERT INTO `course_news` VALUES ('168', '7', 'Qui ipsam sed est praesentium quaerat.', 'Et optio voluptas enim corporis aut molestiae sit inventore necessitatibus pariatur quibusdam aut velit quibusdam quia saepe in facere est animi similique veritatis fugiat vel doloremque nemo non est voluptatibus aut et aspernatur omnis velit molestiae dolorem nisi consequatur quia asperiores voluptatem autem molestiae odit ratione mollitia deleniti hic laudantium animi neque aut occaecati doloremque est aliquid saepe aliquam veritatis voluptate amet maiores provident atque enim quis similique beatae mollitia ex impedit facilis qui quibusdam commodi asperiores voluptas est ducimus qui vel eos cupiditate quae quod corporis omnis laboriosam voluptate incidunt repellendus eveniet vero possimus explicabo soluta voluptatibus dolorum libero tempora beatae repellendus ex aspernatur iure in consequatur voluptatem ut eligendi quis sunt qui consequatur ut similique nostrum qui possimus vel rem molestias ipsam ipsa est et voluptatem similique occaecati et nesciunt delectus nihil esse ipsa nulla velit nemo aut rerum eos vel quibusdam doloremque nisi deleniti quas omnis quo qui nostrum facere ducimus ab et enim modi repellat et et inventore nulla quia excepturi aut repellat voluptatem accusamus ut aperiam impedit unde excepturi aut dignissimos porro voluptatem in aliquam ea dolores cum odit nam id eveniet magnam voluptatem inventore laudantium sunt repellat ad voluptate omnis et est sed sit culpa odio autem aperiam eos nulla vel a non fugit aut eius asperiores ea doloremque ipsam laborum totam sequi est esse dignissimos quidem harum nam perspiciatis voluptatibus molestiae pariatur et reiciendis et optio officiis alias fugiat autem ratione assumenda aut ea nulla sapiente nisi officia occaecati consequatur sint nesciunt ut reprehenderit in labore.', '0', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('169', '5', 'Repellat alias eos eaque sapiente et dignissimos.', 'Repudiandae consequatur aliquam nisi maxime voluptas recusandae perferendis officiis id deserunt blanditiis ut voluptates consectetur temporibus quos impedit illum in nisi fugiat dolores omnis ut et doloribus in enim modi quasi illo voluptas totam itaque modi maxime similique neque reprehenderit et qui quae voluptates ex atque quasi doloribus excepturi inventore quibusdam vitae ad ab maxime aut velit maiores quas nisi voluptas autem nam necessitatibus quia omnis possimus sed dolorum facere ipsum dolorem occaecati velit omnis atque quibusdam optio ut qui omnis incidunt libero aut enim asperiores ea aliquam at dolorem sequi aut architecto tempore rerum quis ducimus tenetur eveniet nulla et officiis quidem autem et iste quasi sed voluptas veniam voluptates soluta quis culpa enim deserunt eos ut quas tenetur corrupti est qui et possimus pariatur et nihil qui rerum reprehenderit ipsa ipsam sapiente enim velit expedita earum sed eius aut non laborum occaecati blanditiis molestiae qui rem repudiandae ipsa facere fugit praesentium quae aut quae quod voluptates rerum molestiae illum quis dolores non nobis voluptatem facilis delectus doloribus est consequatur dolorem ut odit quasi dolor consequatur quod velit cum minus et ut velit quisquam sed magnam et architecto eos et accusantium fugit dolores et harum sunt aperiam sed rerum fugit sit asperiores ut omnis eos blanditiis minima aut inventore voluptate saepe earum veritatis.', '1', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('170', '2', 'Necessitatibus vitae labore accusamus vitae consectetur explicabo.', 'Non voluptatem enim quis eum sed quae ut assumenda illum quis repudiandae minus nostrum minima sequi ut voluptas dolor qui id impedit et enim voluptatem laborum aut nemo itaque reiciendis animi in consequatur sit sint aut id repudiandae voluptas sit sint labore accusamus est et eos iste dignissimos et vero modi delectus perferendis voluptas dolorem vel saepe ipsa sapiente velit dolorem reprehenderit velit deserunt numquam reiciendis exercitationem qui non assumenda sunt at consectetur voluptates odit et voluptate illo et eaque aspernatur odit molestias quibusdam dolorum sint reprehenderit eos alias corporis et cumque sed suscipit soluta quo sed qui totam in sit dolorem unde similique repellendus rerum error odio quia accusamus fuga modi iure maxime quibusdam reprehenderit qui eius inventore dignissimos laborum ut rerum expedita et sunt necessitatibus qui enim optio dolor dolor a voluptatem dolorem corrupti alias ipsam ut odio necessitatibus eveniet nihil voluptas sit quis necessitatibus impedit placeat qui aspernatur occaecati atque maxime fugiat dignissimos magni optio fugit commodi ullam adipisci est non dolorum amet fugiat aut odit pariatur architecto aut voluptas voluptas id tenetur consequatur similique reiciendis facilis minus vel earum ut ipsa beatae ipsam sed reiciendis ducimus odit aut aspernatur harum aut aut molestiae aut blanditiis aliquid cumque sed nam eum molestias.', '0', '2017-05-02 22:58:52', '2017-05-02 22:58:52');
INSERT INTO `course_news` VALUES ('171', '4', 'Quidem enim qui possimus.', 'Ullam excepturi ipsa magnam molestias eius minus aperiam alias eos quo voluptatem laborum voluptatibus sit accusantium nesciunt nam enim accusamus accusantium sed voluptatum sit accusantium aut debitis minus eveniet similique non nulla aspernatur quam incidunt sit iure dolor neque amet corrupti cum nisi veritatis eaque voluptatem maxime rerum perspiciatis repellendus sunt voluptatem aut aliquam itaque est dolore officia eum consequatur molestias animi earum expedita sapiente delectus doloremque est debitis provident illum qui fuga consequatur rerum accusantium sint ratione iusto qui et dolorem voluptate quibusdam sit minus quo dignissimos aut autem rerum quasi sed dolor a omnis repellendus vel ut perspiciatis voluptatibus eos maiores quae laboriosam aut corporis consequuntur odio non iste corrupti ut distinctio assumenda debitis rem debitis tempora perspiciatis fugiat ex illo ut ratione aut voluptas quia id quia rerum voluptatem voluptas natus voluptate vel perspiciatis ipsum necessitatibus dolorem et explicabo ut quo ullam dolores asperiores quod adipisci ut animi dolorem omnis ut rerum eum labore placeat excepturi ut eius ut iste quia qui id ex ea sequi ut esse magnam minima omnis error earum corporis a quia vel tempore voluptatem exercitationem ut libero eligendi tenetur dolores occaecati voluptatem accusantium quia harum consequuntur libero ducimus culpa porro quidem distinctio dolores qui tenetur ea molestiae qui in labore recusandae quis nam dolorem harum culpa molestiae quidem voluptas harum laudantium itaque sint beatae sunt pariatur doloribus in accusantium consequatur doloremque quidem repudiandae laborum voluptatem nisi dolores corporis repellendus et labore qui aut quisquam nemo consequatur enim tenetur ratione eaque accusamus quia autem officiis in est unde possimus dolores reiciendis voluptates magni placeat suscipit.', '0', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('172', '10', 'Iusto libero mollitia dolorum.', 'Et animi ipsum nesciunt qui non nihil suscipit et natus aut laudantium suscipit qui est sed nostrum optio voluptate rerum dignissimos omnis beatae odio cum architecto minima earum iusto corporis in enim vel eius saepe consectetur nihil itaque laudantium quas omnis et aliquam quae modi consequatur et aut ipsum repellat aut et est vel consequatur dolores dolorem corrupti sunt incidunt minus saepe neque mollitia tempore quisquam nobis adipisci blanditiis et aut quaerat accusamus nihil aut velit inventore voluptatem ut eos culpa consequatur quam error mollitia et a ut eius architecto quod voluptas quibusdam quia et nam repellendus impedit cupiditate dicta autem ratione voluptas laudantium aliquid porro porro sunt facilis quo totam incidunt unde ut eum vitae suscipit rerum ab ut iste sed maxime voluptates ex est nesciunt exercitationem rerum neque qui et sit deserunt optio doloremque cupiditate itaque totam iure voluptate ut aut sequi maiores voluptatibus architecto aut consequatur similique autem et ex et error cumque sequi at sed itaque est libero nostrum omnis vel molestias cumque minus vero quaerat id et ullam cumque vitae aut ipsum iusto porro tenetur illum dolorem nesciunt excepturi explicabo delectus qui aut corrupti iusto illo totam quas omnis maxime distinctio sed et iusto aut in deserunt eos corrupti sed et sit animi ea non doloribus pariatur inventore ipsam animi dolores sit sint provident et ea voluptatibus ut modi est est ipsum sequi atque exercitationem unde sit cum molestiae et rerum reprehenderit velit totam consequatur libero dolorem qui deserunt atque nisi dolore hic qui rerum qui consectetur ut aliquam aspernatur provident qui enim ex voluptate aut at qui qui labore blanditiis voluptate quisquam nemo sunt perspiciatis placeat fugit non sed qui necessitatibus velit quis sint autem inventore sapiente ab et quod autem molestiae voluptas voluptatum eligendi voluptatem consequ