INSERT INTO `course_news` VALUES ('173', '7', 'Minus in rerum ea id commodi.', 'Expedita rerum rerum ratione voluptates recusandae maiores a distinctio magnam ducimus ut est quam a optio voluptatibus quidem accusamus in odio voluptatem quaerat excepturi et nemo occaecati dolores accusantium non hic corporis nostrum veritatis consequatur sunt qui sed dolore perferendis debitis quia qui expedita aperiam ex dolor ut enim laudantium quo nihil possimus corporis ipsa et nobis nam sit aut blanditiis eum dignissimos perferendis qui velit odit non earum velit alias et at dolorum in atque qui cupiditate architecto sed accusamus atque facere officiis assumenda omnis et ut sint debitis voluptas animi et ex autem eius cumque eaque quia corporis reiciendis quidem similique rerum sit molestiae consectetur id distinctio perspiciatis sint expedita velit distinctio sit eos dolorem nostrum ex nemo debitis at ipsam quia assumenda officia molestiae rerum exercitationem sit libero impedit quia suscipit molestias ducimus veritatis modi ut sed in quibusdam tempore deleniti magnam eos cumque ab et voluptate totam excepturi tenetur labore ipsa praesentium officiis qui facilis iste facere necessitatibus aut sed aperiam laudantium fugiat laboriosam voluptates quas quia in facere ut velit tempora suscipit nisi sit minima quod labore hic tempore molestiae et aut dolorem laudantium vel quod alias maxime sit natus laudantium aperiam sint doloribus commodi exercitationem sunt similique unde ad aut voluptatem porro illum quia iure aut nisi quos consequuntur dignissimos sit cupiditate optio et maiores commodi quis laudantium qui iusto cumque nesciunt eaque minima quae tempora aut dolores maxime nisi ratione unde perspiciatis dignissimos repellat ut non labore esse autem consequatur soluta doloremque repudiandae qui qui soluta et unde ipsum architecto ratione velit consequatur rerum consequatur excepturi unde amet.', '0', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('174', '8', 'Et occaecati rerum molestiae sunt.', 'Doloremque vel et ratione fugiat quae ut eos accusamus vero qui delectus dolore eos saepe qui sit deserunt aut sunt pariatur consequatur velit ipsa cupiditate ut et dolorem consequuntur itaque explicabo culpa autem nobis est quo adipisci necessitatibus sint reiciendis eos quibusdam labore alias harum magnam assumenda laboriosam labore est suscipit minima labore libero aperiam est minus temporibus autem temporibus accusantium aperiam animi provident suscipit aut saepe repellendus incidunt quidem adipisci ut omnis est blanditiis incidunt tempora a iusto veniam sed eius sit voluptatem laboriosam ut quisquam sequi debitis dolorem dolores mollitia autem dolorem culpa quisquam reiciendis nam odit dolor quo facere autem quis officiis delectus dicta quia rem qui maiores esse quis atque labore et ex consequatur impedit atque fugiat quia at voluptas sint laboriosam sunt magnam unde nam aspernatur perferendis placeat accusantium consequatur cumque magni eius consectetur qui ea voluptatem provident debitis reiciendis neque itaque blanditiis ipsum rerum tempora sunt corrupti quasi reiciendis eaque est velit doloribus dolorem quos quisquam est officia ut explicabo magni voluptatem ad voluptatem qui est commodi optio placeat corporis qui numquam molestias rem nemo in dolor harum veritatis repudiandae sed et dolorem esse perferendis laudantium odit odio quia expedita accusantium odio veniam minima assumenda molestias soluta minus doloremque odit perspiciatis nisi autem soluta dolores iusto non quia est facilis numquam et qui sit recusandae in in in velit debitis voluptates omnis nam necessitatibus nam vitae fugit est repellat quo architecto consequatur nisi consequatur deleniti velit deserunt ad beatae vero doloremque dolore iure odit ipsa provident sunt nihil quos omnis omnis temporibus qui atque alias natus est enim qui optio omnis in nisi corrupti occaecati iusto unde sunt blanditiis adipisci ma