INSERT INTO `course_news` VALUES ('175', '6', 'Debitis sit quo rerum cumque sequi fugit.', 'Et aut laudantium enim ad in voluptas ipsum sint et voluptas velit quae est ullam quis voluptatem et laudantium nihil quos pariatur fugit repudiandae culpa eum aut libero adipisci et ut et rerum in et nihil modi alias quia amet dolorem delectus deserunt ut suscipit error suscipit iure dolorem exercitationem sed odio dolores et vero vel sed omnis vitae odio qui voluptas voluptatibus eligendi consequuntur quidem blanditiis iure eos quos voluptas sapiente sapiente illo aut mollitia rem quis odit labore expedita delectus fugiat numquam cupiditate quasi quibusdam ea labore aut similique et dolorum repudiandae qui minima voluptatum et repellendus debitis molestias dolor eum iste architecto blanditiis nemo et omnis voluptas odit aut rerum ut non rem voluptatibus fugiat tempora mollitia aliquam quod harum molestiae est dolor repudiandae molestiae nulla in ipsa fuga optio quia quibusdam et libero eaque ratione est et magni minima sed non laboriosam adipisci nihil ab molestiae nam sunt quaerat quidem quae aliquam in nisi et iusto error modi sed omnis qui non rerum culpa ipsa ad quod sed reprehenderit iste laboriosam placeat qui aut beatae libero fugiat perferendis tempore dolorum ut commodi ut reiciendis minima in neque recusandae at fugiat cum labore cumque corrupti tempora labore voluptatibus quis beatae eaque et ipsam autem voluptas est laudantium voluptas ullam minima ducimus tempora rerum beatae maxime quae porro eos natus ut itaque soluta molestias nulla laudantium maxime rerum quo voluptas accusantium aut qui aut sit corrupti quia odit laboriosam laboriosam impedit ducimus ad sint sint cupiditate et dolorem non eos odio minus minima et rerum dolor ex voluptatum officiis delectus qui voluptatem eos saepe non dolore atque id dolores assumenda natus veritatis hic porro impedit.', '0', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('176', '6', 'Nihil fuga explicabo quos cumque quia ex distinctio.', 'Et debitis tenetur similique mollitia nihil culpa commodi incidunt saepe accusamus quis sit non rerum laboriosam consequuntur doloremque est explicabo iure sed mollitia et et consequatur provident consequatur eos illum delectus quia ut qui velit aperiam et nam dolore laborum sit dignissimos iusto ut ut et officia vel aliquam accusamus voluptas necessitatibus ipsa in ad enim provident amet dolorem at fugit id ipsam autem quas rerum beatae blanditiis possimus omnis quisquam recusandae deleniti in quo explicabo fuga voluptatem nisi quisquam architecto ea voluptatem ab iusto dolor ullam harum itaque dolor numquam atque sit dignissimos quod at harum possimus odio tempore dicta suscipit delectus eaque tenetur voluptatem consequatur esse aperiam vitae tenetur voluptatibus laborum dolore magni voluptas dolorem a est nam tempora architecto vitae minima consequatur cum numquam facilis sequi voluptatem sapiente expedita sit repudiandae recusandae sint expedita dignissimos non quae molestiae natus voluptates nostrum omnis similique et molestias aut rerum velit mollitia in fugit numquam magni suscipit inventore sint ipsum quia alias assumenda quis a velit corporis nihil aut officia quia ut maxime earum sunt rerum doloribus aspernatur et assumenda porro recusandae et inventore quia debitis vitae omnis quae blanditiis ut id maxime eaque et sed pariatur aspernatur culpa illum ipsam et veritatis debitis aspernatur vel occaecati natus similique sunt veniam consequatur dolorum corrupti commodi sit fuga temporibus corporis sint qui ex amet veritatis qui cum saepe sit iste qui assumenda cupiditate veniam quia corrupti quos ducimus qui voluptatibus vel autem architecto et ea repellendus praesentium eaque commodi doloremque nulla et aut quas vero aut asperiores ad et eum possimus beatae est unde vel sint quo quo natus quo magnam quia minima quidem quia et et sunt quia nesciunt laudantium