INSERT INTO `course_news` VALUES ('177', '2', 'Aut voluptatum omnis id architecto perspiciatis.', 'Optio totam unde enim sequi impedit dolore maxime voluptatem nostrum nihil at iste repellat rerum ea ut est ea qui animi quisquam minima quisquam eveniet ea perspiciatis non esse aliquid voluptatibus soluta id aspernatur ut qui magnam voluptatem quia reiciendis aut est sit quia natus ut facilis ut eos consequatur nam accusantium vel nemo tenetur hic repellendus aut ut facere et incidunt maiores porro ut eaque quisquam tenetur quisquam suscipit et similique blanditiis nihil dolorem laborum aut dolorem iusto rerum est quia ea perferendis sit suscipit natus magnam quia quo aut harum voluptatem corrupti quasi est impedit non rem a ut et aliquam est sunt et aut iure eos ut dolor dolorum tempora adipisci ipsum sed quasi eius incidunt autem aperiam et suscipit consequatur aut qui qui mollitia et est sapiente et aliquid est fugit sapiente rerum ea consequuntur molestias voluptatem voluptatem nisi velit at sapiente tempore ut id aut dolor dicta similique laudantium est dolores modi quisquam ullam fugiat ipsa dignissimos temporibus qui dolorum ea aut asperiores ratione voluptatem reprehenderit placeat in eaque reprehenderit commodi autem eos ducimus quia labore animi voluptatem non eius ullam expedita ut explicabo temporibus officia omnis distinctio et saepe autem et cum sunt aut autem quis id quisquam quis rerum facilis sit occaecati sequi sapiente et ea fuga qui tempore nostrum vel velit aut delectus quis et quam ducimus sunt nemo quisquam velit doloribus earum error fugit eum id doloremque quis corrupti corporis et delectus molestias qui sunt enim reiciendis fuga ab dolorem error qui repudiandae et nulla deserunt sapiente ut inventore aut porro asperiores doloremque sed quod eaque laborum rerum hic et totam ipsum reprehenderit quaerat et possimus nemo nihil voluptatem ducimus ut quasi repellat eum.', '1', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('178', '2', 'Rerum aspernatur ducimus ut ut saepe reprehenderit unde.', 'Qui nobis repellendus iste ut sapiente cum voluptas voluptas laudantium nesciunt a repellendus blanditiis sapiente ipsam ullam et aut accusamus nulla et iure dolores qui praesentium ea non qui labore ab qui non ratione libero rerum quibusdam est qui magni quia officia expedita dolores eligendi tempora non rerum nihil delectus corrupti mollitia asperiores est ut pariatur repellat tempore ullam vitae ut ut et eius id expedita dignissimos consequuntur aut atque nostrum consectetur ut quia odit modi delectus et ducimus autem recusandae ducimus quod non iusto eligendi commodi id libero nemo sapiente fuga et quos laborum porro aut accusantium rerum autem quas doloremque et esse distinctio nihil praesentium nostrum libero odio molestiae iusto ipsum recusandae itaque qui nostrum hic quisquam eaque optio nobis quaerat neque occaecati dolor aliquid voluptates est voluptas nobis nulla blanditiis assumenda minima illum et doloribus quia aut suscipit sint quo sit quisquam quibusdam dignissimos eum rerum at sit qui in illo quo alias velit nihil distinctio sint vero illo veritatis quo possimus quibusdam blanditiis totam consequatur magnam porro omnis dolore soluta doloremque impedit velit vitae necessitatibus quo aut laborum adipisci tempore eos doloremque laborum voluptatem porro rerum neque aliquid consequatur vitae aspernatur quidem iusto in earum dignissimos animi velit dolorem sunt excepturi ex et et facere quas corrupti placeat nesciunt ullam aut voluptatum reiciendis occaecati omnis officia aperiam ullam vel.', '1', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('179', '5', 'Odit ut debitis quibusdam aut consequatur ipsam voluptatem inventore.', 'Incidunt est impedit ad consequatur voluptas vitae est ut exercitationem sapiente dolores atque nihil ut sunt nobis consequatur quo officiis minima aut asperiores id enim et excepturi et perspiciatis vitae rerum ut id in consequatur ratione atque accusamus dignissimos possimus expedita consequatur eaque consequatur dolores et illum ab blanditiis suscipit non quo dignissimos quo omnis nihil architecto non quo suscipit distinctio et quibusdam sunt magni maiores eaque sed magnam modi rerum et vel maiores odit qui quibusdam natus soluta et accusantium repudiandae est molestiae aliquam officia ipsam ad est perferendis nam perspiciatis eos quis nihil inventore consequatur laboriosam quos doloremque at omnis expedita saepe ut exercitationem non quam tempora quia at reprehenderit nisi aperiam eum qui quia officiis non quidem beatae natus voluptas magnam aut sed sint pariatur iusto amet repellat repellat consequuntur quibusdam neque voluptatum sunt consequatur et dolore quae saepe voluptas veritatis molestiae reprehenderit qui possimus repudiandae voluptas laudantium est eos qui sit sed fugit enim minus voluptate blanditiis numquam voluptatem saepe et aut sit sed amet velit rem aut officia aut fugit dignissimos aut aliquam quia officiis vel at aut autem ut et nesciunt ea nobis rem et autem distinctio animi qui delectus quae dicta eos et tenetur assumenda reiciendis nesciunt neque quae aliquid quia numquam doloribus veritatis nihil quam voluptate voluptas voluptate similique sed nam tempore hic sed rerum natus in consequatur ad et dicta dolores officia quam et libero beatae quibusdam et magnam iusto animi repellendus dolores maxime nesciunt sequi nihil quod itaque reiciendis voluptatem error voluptate consequatur qui quo iure dolore velit dolores.', '1', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('180', '3', 'Illo qui omnis ea est impedit.', 'Debitis ullam dolores labore magni quis consectetur laudantium aut et possimus eaque quam soluta est quia aliquam modi voluptate fugiat impedit ipsa accusamus tempore fugiat odit et minus ullam eligendi aperiam fugiat ea quis et corporis et sed non dolor ut nam maxime rem cum impedit blanditiis voluptates quidem non itaque harum doloribus non at quia expedita voluptates voluptatem autem quis enim beatae voluptas quaerat id suscipit doloremque consequatur voluptas consequuntur quae quia et ipsum repellat et minima quod consequatur excepturi optio molestiae et voluptatem est aut repellat et culpa ab sint excepturi mollitia ut fuga aspernatur aut explicabo natus nihil sequi cumque magni modi non minima eveniet qui odit quod corrupti voluptatibus eveniet aliquid consequuntur explicabo veritatis quam quidem et accusamus omnis aut repellendus dolorem fuga voluptatum ut ut suscipit ea enim repudiandae id autem qui omnis quos et sit magnam sequi neque ut aut consequatur ex rerum et consequatur quia praesentium quasi corrupti et culpa officiis doloribus officiis blanditiis nesciunt consequatur possimus iure numquam laborum expedita eaque alias nulla ipsum sed ex saepe aliquam blanditiis animi et exercitationem ut blanditiis quis eaque et inventore debitis corporis minima architecto provident recusandae velit nostrum eos ipsa sapiente sint ad animi omnis et minima voluptas assumenda perferendis enim maxime unde eos et adipisci ipsa velit eum voluptate harum vel totam aliquam dolorem atque neque sint ad impedit debitis non fugit dicta a doloribus doloribus cum distinctio odit perspiciatis iure eos molestiae aut amet labore voluptas est eaque minus et et asperiores aliquam eveniet velit sequi omnis voluptas et et et voluptatem beatae et et excepturi praesentium dolores sed ipsam provident excepturi ducimus itaque debitis et aspernatur quae aut maiores possimus distinctio sit reiciendis dicta magni 