INSERT INTO `course_news` VALUES ('181', '8', 'Iure architecto ipsam tempora dolores est.', 'Sint ut a nisi et fugiat non tempora debitis eligendi debitis et reprehenderit quidem fugiat est aut sit accusamus nesciunt libero quo voluptatem voluptas est at laborum dolore quia nisi porro repudiandae sint et voluptatum tempora non dolores dolores voluptatum exercitationem velit sit quaerat in dolorem id et libero porro sunt amet vitae incidunt veritatis atque temporibus eveniet cupiditate cumque inventore quia assumenda corrupti earum itaque sit quibusdam consequatur voluptatem provident et consequatur nemo cumque est nam et accusamus molestias ut error inventore animi cumque ut voluptatibus aut aut odio aut fuga officiis ipsam esse quam velit ab non fuga autem architecto mollitia odio nam accusamus ullam ad consectetur consequatur sapiente assumenda corporis quo fugiat praesentium error culpa voluptatum aspernatur et ut adipisci rerum non placeat saepe qui recusandae consequatur optio rerum ab inventore blanditiis illum fuga voluptas veniam neque eos harum sit nulla dicta eos quia consectetur facilis cum corporis enim et nobis doloribus iste vitae qui velit aspernatur cum fugit esse dolores dolorem ipsam aut ut nulla dignissimos sapiente mollitia et consequatur ut voluptatibus error repudiandae dolorem enim aut qui quis facilis inventore eveniet autem sit non saepe sed vitae sint cum aspernatur occaecati sint doloribus deserunt et exercitationem assumenda nihil ut recusandae et id eos incidunt ipsam id sunt omnis dolorem provident cum accusantium est aut eos voluptatum totam aut quis molestiae eum molestias impedit cupiditate odio quis totam.', '1', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('182', '10', 'Cum perspiciatis quibusdam occaecati optio quibusdam non nihil non.', 'Consequatur error rerum ab facere omnis nobis dolores ut nemo non ad error est quasi itaque enim a beatae rerum nemo suscipit ea natus quos delectus ea deserunt quia adipisci et modi et itaque reprehenderit repellat enim nemo et voluptate accusamus dicta recusandae et exercitationem voluptate velit ex omnis voluptatum ut quia optio pariatur voluptatem molestiae consequuntur et blanditiis nostrum autem dolore cupiditate quibusdam qui eum odit mollitia laudantium cumque veniam omnis sint optio ut est totam in nobis dolor et provident animi amet commodi dolorem sapiente iusto asperiores odit placeat in reprehenderit veniam rerum qui explicabo impedit ipsum et accusantium qui aut quaerat in voluptatibus ducimus ea quo aliquam tempore blanditiis iure vel harum necessitatibus amet culpa officia nobis error officiis corporis eos sed voluptas autem et sed veniam id provident animi quod voluptatem cum reiciendis voluptatem hic fugit necessitatibus eos illo maxime qui placeat dolorem culpa est cum quae placeat incidunt inventore eaque et facere culpa mollitia consequatur voluptatum tempora perferendis quisquam ut amet blanditiis nesciunt vel cum vero aperiam adipisci cumque incidunt est et velit culpa suscipit minus aspernatur soluta cum possimus quae modi facere dolores est ad qui et eos nemo quia esse molestiae provident eos molestiae et impedit eaque et aut aut excepturi voluptatum consequatur consequuntur cum ut architecto officia commodi quod necessitatibus ex voluptatem aut at esse.', '1', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('183', '9', 'Expedita quisquam minima ut pariatur soluta rerum.', 'Sit quidem laboriosam voluptatum explicabo dolores vel ut et nihil sunt dolor repellat ipsum amet consequatur dolorum similique in alias consequuntur asperiores est libero hic earum est voluptatem mollitia nemo aliquid nihil atque et eum ut ut vel repellat quo corrupti vel dolorem pariatur omnis ut autem dolorum rerum mollitia sint tempora veritatis delectus nostrum qui iure excepturi fuga et aut nulla vitae ut rerum beatae harum quia iure magnam quas saepe et et architecto nihil ullam qui non qui deleniti aut enim eius ea fugit quidem similique aut et eum iste ullam qui est sit ea nihil vero quisquam expedita quod voluptates nemo voluptatem consequatur odio pariatur ducimus nesciunt fugit ut ducimus distinctio ducimus sed quia perspiciatis tempora dolor recusandae quaerat at officia quae consectetur corporis nostrum ut ex ex autem iste modi labore laudantium eveniet modi ratione nisi blanditiis omnis maiores delectus reprehenderit rem et officiis nemo fugiat ab officiis impedit nostrum rerum et ducimus molestias qui et eum dicta libero expedita maxime modi eius sed consequatur deleniti aut voluptatem officia non doloremque magni blanditiis voluptatem consectetur quis et rerum quis ut temporibus qui natus et quis omnis eum laudantium aut fuga deserunt eius repellat rerum enim sapiente in eum non expedita et adipisci incidunt hic.', '0', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('184', '9', 'Maxime voluptates explicabo vel.', 'Tempore ut a qui beatae et quisquam quisquam consequatur voluptas nihil minus dolorum amet ad voluptatibus a soluta corrupti ex doloremque maxime distinctio et et consequatur fugit quos quia veritatis aspernatur molestias accusamus tempora omnis modi provident numquam corporis et dolorem aspernatur totam aut est commodi corporis inventore aperiam error aut et rem consequuntur expedita quia itaque neque magni sint possimus optio perferendis iste architecto a eligendi tenetur mollitia repellat dolor quia voluptatibus quo rerum et odio aut tempora autem qui minus est nemo et ipsa tempora nisi quo et culpa quia eius laboriosam quia ut necessitatibus eum enim assumenda laboriosam modi et assumenda animi repellendus ut quaerat voluptas voluptatem consectetur non cumque consequatur dolores aliquid ipsa cumque aliquam id autem nulla numquam quo corporis sed tenetur consequatur et deserunt dolorum voluptas maiores ut sed eos quis est impedit soluta autem quae rem provident accusantium distinctio quidem repudiandae veniam id tempora beatae non est enim doloribus iusto accusantium quae commodi repellendus corrupti aut aut est molestiae sit sapiente cupiditate velit eaque occaecati sint veritatis repudiandae quisquam voluptatibus eum impedit rem magni consequatur harum at fuga ipsam ipsa dolores repellat id id rerum quia vitae vel labore iste veritatis qui omnis non harum consequuntur commodi repellendus ut voluptas quasi debitis nulla totam atque sed aliquam voluptatem inventore eos itaque eveniet sed vel a nam sunt iusto maiores est non repellendus nemo ut et et amet ea ea ut fuga quia earum quo eius assumenda mollitia odio id aut labore provident et repudiandae velit quia rerum voluptas aut debitis repellat et et unde doloremque eos dicta iste omnis et molestiae neque non ipsam voluptatem consequatur quam officia quo et quia nesciunt est quisquam cum est natus recusandae mollitia necessitatibu