INSERT INTO `course_news` VALUES ('185', '9', 'Eum occaecati ut tenetur iure perspiciatis voluptatem consectetur.', 'Iste est rerum ex dolorem facilis laborum aspernatur et iusto id eos reiciendis eius dolores et eaque officia odit fugit hic cum vel aperiam repudiandae ut labore et neque eius natus modi atque excepturi consequatur aut quis rerum voluptatem laboriosam earum provident at vel ullam placeat unde qui eum aperiam ipsa qui et facilis assumenda totam rerum ipsa ex aut porro aliquid aut tenetur beatae modi illo ut minima minima dicta in nobis mollitia dolores ut repellat id fugit et ut quae est ipsum quo qui ea nobis sint dignissimos explicabo unde voluptatem et distinctio accusantium et similique odio autem natus modi adipisci ratione quia vel ea molestias suscipit sunt mollitia voluptatem voluptate ut ipsum sit animi adipisci ullam minima impedit error ipsam dolor sunt minima et omnis et id mollitia labore qui aut voluptas pariatur sunt veniam voluptatem ullam dolorem quibusdam commodi corrupti quis quae fugit enim ipsum excepturi a et magni deserunt sunt accusamus et eveniet veritatis voluptatem id sed ducimus excepturi ex et quia et eos laboriosam qui repellat unde earum consequatur quam minus repellendus et unde numquam iure quae facere odit consequatur expedita aliquid incidunt eum quasi sunt et nisi labore et cupiditate at exercitationem corporis laboriosam qui magnam temporibus non ex aut non a quo fuga eligendi non eaque vel aperiam rem ipsa qui perspiciatis fugit rem sit beatae culpa velit reiciendis sint ut aut fuga qui recusandae minus aut est aliquam placeat voluptas ea id id corrupti quis a eaque commodi blanditiis corrupti sunt et aperiam facilis dignissimos qui ratione corporis sit repudiandae impedit culpa rerum neque sunt occaecati qui hic perspiciatis ea doloribus eos nesciunt dignissimos non et dolor repudiandae perferendis possimus iure quis sunt officiis.', '1', '2017-05-02 22:58:53', '2017-05-02 22:58:53');
INSERT INTO `course_news` VALUES ('186', '8', 'Consequatur nulla ea consequatur quas harum consequatur quisquam.', 'Veritatis tenetur cumque ipsam iure similique aspernatur autem enim quibusdam eos fuga ducimus esse est rerum est inventore est aut sit cupiditate qui sunt doloremque qui est eligendi vel quia libero dolor est aut laborum veniam harum tempora ullam quod reiciendis iure magnam in voluptas odit ipsam quos voluptatem qui harum et et repellat ipsum facere et placeat voluptatem est repudiandae dolore quasi incidunt ut cumque esse molestias ut distinctio labore facere maiores eius consequuntur ut quae error ut provident sunt aliquam ut vitae sunt qui sit dolore molestiae necessitatibus nesciunt et veniam sed aut accusamus illo culpa laudantium esse ut mollitia quo a quaerat velit repellat qui non explicabo delectus quia aliquid veritatis rerum deserunt pariatur ipsam at dignissimos possimus ad vel ratione qui laboriosam delectus excepturi sit est eligendi et animi corrupti commodi reprehenderit ad nesciunt aut dolorem rerum dicta laborum sunt maxime molestias exercitationem ut amet laborum et officiis sed eum voluptas est dolorem non harum asperiores labore alias odit possimus ut et assumenda perferendis sed autem illum quia molestiae aut labore consectetur aut iusto quo nisi ut rerum repellat tenetur repellat nesciunt eos facere dolores reiciendis ex vero exercitationem et nobis labore voluptatum qui et magnam delectus dolorum temporibus assumenda repellendus cupiditate possimus aut occaecati accusamus in magni perferendis sit distinctio nihil accusantium quos aut voluptas consequatur optio eaque recusandae hic hic exercitationem consequatur repudiandae mollitia rerum omnis ad fuga perspiciatis alias vitae ab nesciunt modi voluptatem sed consequuntur molestias sint illo iusto sit occaecati et autem ut temporibus voluptatem ipsum deleniti et aspernatur aut totam sed numquam ea dolorem fugiat alias beatae repudiandae quam qui delectus veritatis quia dolorum m