INSERT INTO `course_news` VALUES ('187', '10', 'Cum ad unde totam at quod assumenda aliquid.', 'Omnis quae aliquid reprehenderit consequatur ut perferendis esse vel error cum aut perferendis necessitatibus architecto dignissimos vitae qui voluptates officia sapiente fugiat vitae quod aut ipsum culpa incidunt tempore dolorem rem nulla aspernatur sequi error et quo voluptatem nihil sit dolorem non ut veniam perspiciatis ipsam repudiandae sapiente adipisci labore repudiandae aut tempora cum molestias et sed ut qui sed veniam et modi in ratione molestiae voluptates itaque illo eum vel aut quo et odio aspernatur dolorem aut vero quos provident sed qui sapiente autem soluta temporibus dolores quam illum rem exercitationem fugit occaecati aut natus quia nulla aut voluptates ut soluta rem perspiciatis fugit doloribus fuga quo enim ut voluptatibus velit ut autem eum corporis modi nulla velit ea nihil veniam nam voluptatibus quidem in quibusdam iste natus at reprehenderit officia assumenda occaecati voluptatem pariatur expedita dignissimos omnis quas ea ratione nemo adipisci veniam ut voluptatem est vel doloribus dolorum dolor voluptatem recusandae expedita est ut adipisci mollitia rem expedita hic ut consequuntur ut illo saepe et dolore non nisi harum consequatur adipisci consequatur non quaerat sit ducimus quaerat sit et vero aut repudiandae nostrum rerum ipsam rerum ut culpa eligendi deserunt laudantium veritatis neque nam temporibus blanditiis incidunt inventore labore commodi qui voluptates dolor incidunt alias odit sint non deserunt delectus animi repellat id aliquid quo sequi ad quaerat occaecati laborum et laboriosam commodi laudantium eum omnis inventore aliquam vero nihil nesciunt non cum voluptate voluptas sunt sint minima ut est facere repellat ut magnam eligendi et autem perferendis cum magni dolor tempore quod velit molestias dolorem dolore voluptatum in autem autem sunt eum cupiditate quia consequatur vero id ab adipisci voluptas aut perspiciatis eos vel aliqua