INSERT INTO `course_news` VALUES ('188', '6', 'Occaecati recusandae consequatur explicabo excepturi sit incidunt accusantium.', 'Tempore maiores et suscipit dolorem et officiis et perspiciatis voluptatum est eligendi dolore aut aperiam aut optio sit temporibus expedita laborum voluptatem dicta sunt vel cum dolore distinctio et error dolorem rerum rerum facilis ducimus error illo atque assumenda et et qui distinctio eum aut ipsa est dolores assumenda illum debitis error voluptatum veritatis natus repudiandae quis pariatur enim dolores corrupti cupiditate et quisquam pariatur ea doloremque dolor consequatur incidunt molestiae id quibusdam placeat ut aliquid consequatur et et alias ut vel est doloremque ut illum ab suscipit recusandae ea autem in tempora dolores amet aut cumque consequatur natus quia beatae quasi aspernatur saepe aspernatur provident totam voluptas earum voluptas reprehenderit nobis tempore ut veritatis perferendis ipsum sequi non voluptates qui iure sit sit cupiditate aut corrupti odio ipsum atque impedit incidunt sit ut dolore amet quis temporibus optio deleniti delectus dignissimos quia eos tempora facilis culpa aut ad quidem ut labore et reiciendis reprehenderit veniam eveniet est debitis laborum impedit omnis repellendus sapiente laudantium voluptates non eius magni nemo sed exercitationem rem alias id alias molestiae sequi et neque minima cum atque accusamus suscipit eaque velit nihil unde omnis perferendis reiciendis magni qui voluptas est eaque recusandae animi aliquam ut hic doloribus velit veniam sit eligendi numquam hic consequatur corporis debitis totam et cum exercitationem explicabo at error cum at tempora molestiae temporibus dolores itaque officia iure unde recusandae eum voluptas sunt incidunt omnis.', '1', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('189', '6', 'Necessitatibus consequuntur autem quidem voluptates in porro veritatis.', 'Non eligendi quaerat quam sit ratione molestiae illo voluptatem sequi nihil in aliquid voluptatem aperiam nemo doloribus id ut sed rerum eius debitis sapiente sequi sint expedita repellat et fugiat maxime minus et molestias enim iure deserunt rerum reprehenderit itaque quaerat sit quo possimus saepe enim non voluptas quae quod veniam sequi non dolorum ratione in sit eligendi nemo in velit natus velit quis sed et omnis consequatur distinctio dolorem aut autem repellendus ut quam quas rerum officia dolorem optio ut voluptates culpa neque deserunt nobis minima dolores et dignissimos officia vel natus est vel fuga quaerat molestiae nobis aperiam perspiciatis culpa ducimus corrupti vel minima quas blanditiis laudantium repellat illum sapiente voluptatem voluptatem dolore nisi aspernatur est ut sapiente est hic tenetur doloremque dolorum sunt nihil numquam sed reiciendis dolores dolor inventore et sint et aut et blanditiis explicabo cum ut quo ipsum alias voluptatem et ut iusto aliquam autem cum error repellat dolor culpa autem totam officia excepturi ratione odit error enim perspiciatis ullam aperiam architecto pariatur fugiat velit reiciendis laboriosam velit nesciunt pariatur vel fugit illo beatae fugiat maxime ea ab aperiam eum neque odit sunt tempore ratione alias eum aspernatur nobis sequi suscipit ipsam excepturi molestiae occaecati molestias fugiat sint soluta dicta ad quam impedit eos debitis fugit enim inventore nihil molestias hic enim quibusdam deleniti voluptatum quia modi cum eius voluptatibus cumque corrupti est quo aut aspernatur rerum porro sequi nesciunt maxime incidunt in eum ut accusantium ipsum quidem temporibus et id reprehenderit aperiam architecto quibusdam nemo dignissimos earum magnam deserunt veritatis inventore doloribus veritatis ipsum quis assumenda ex deserunt necessitatibus officia vitae perspiciatis repudiandae voluptat