INSERT INTO `course_news` VALUES ('190', '8', 'Beatae dicta aperiam quam dolorum sunt.', 'Rem odit neque unde deserunt neque nihil quia quibusdam veniam sint voluptas et id vitae necessitatibus eveniet quo ratione eius in ab quaerat et perspiciatis quasi aut ut consequuntur ratione minima distinctio maiores dolores quisquam voluptas voluptatem aspernatur eveniet iusto ipsum molestias quod labore molestiae vero repudiandae impedit libero harum nihil similique sed ut aut libero maiores et facere nihil quidem vel dolor qui impedit temporibus laudantium ea iusto fugiat qui esse aliquam exercitationem incidunt ratione sapiente quisquam veniam rerum iure cumque qui voluptas labore dolorem neque qui delectus similique dolorem ut mollitia mollitia magni odio praesentium est commodi quaerat mollitia iure sed molestiae provident sequi illo accusamus et est distinctio possimus vel sequi autem doloribus omnis labore distinctio eos ad corporis ut aut et autem voluptatem enim omnis nulla dolorem pariatur delectus deleniti adipisci perferendis deserunt eum rerum rem officia fuga ut sint sit velit quia ut non molestiae tenetur possimus accusantium eum dicta dicta facilis deserunt recusandae explicabo consequuntur ut aliquam consequatur provident molestias provident sint ipsam numquam dolore aut aliquid cumque corrupti numquam omnis possimus quaerat distinctio porro similique natus reiciendis voluptatibus deleniti at voluptate et aliquam aspernatur omnis et id nobis consectetur molestiae asperiores asperiores harum delectus voluptatem eius debitis omnis non nulla quia eius harum placeat perspiciatis quod atque cumque dolorem nostrum eum possimus velit sint inventore voluptatem neque dignissimos nobis voluptas consequatur excepturi expedita voluptatem et quia dolores natus velit et ea numquam harum tempora fuga aut magnam et rem iste et nesciunt doloremque qui est est consequuntur delectus et neque et est vitae est facere illum nisi velit ut inventore magnam similique tempora occaeca