INSERT INTO `course_news` VALUES ('191', '10', 'Dolores asperiores ipsam a nam rem.', 'Quas consectetur vel excepturi eius voluptatibus quo totam voluptatem aspernatur enim cumque voluptate nemo sequi labore magni inventore dignissimos aut harum ut sed quo repellendus ea ut ipsa voluptate commodi adipisci qui animi consequatur reiciendis magni quaerat soluta molestiae quo optio doloremque perspiciatis voluptas exercitationem molestiae a facere laborum totam error quasi in omnis rerum eum ipsum dolorem eum eaque libero animi ipsa natus voluptates vero sit neque qui quo ut et est voluptatibus magnam inventore deserunt blanditiis at nam saepe aperiam ea sed quis ullam explicabo et sint dolorum cumque qui fugit atque quo alias ipsum quo ad non eius et perferendis id quaerat enim nesciunt officiis vero atque fugit fugit vero vitae facilis voluptatem ipsam sed et vitae dolor sint et assumenda quisquam neque ipsum unde consequuntur quod quo magni dolore qui debitis rerum dolor quibusdam sit tempora hic labore minima aut eligendi sed eaque quia mollitia vel facilis repellat magni minus ut aut quia quos dolorem et deleniti possimus illo natus deleniti qui architecto odio et eaque autem aut totam beatae corrupti modi autem perferendis modi non veritatis vel at laboriosam eum ut totam autem facere nemo sint ullam ut eum aut quia blanditiis itaque est quo delectus unde consequatur incidunt vel deserunt aliquam aliquam magnam corporis reiciendis delectus expedita consequuntur minima soluta cupiditate quibusdam dolore nulla ut voluptate quaerat deleniti molestiae aut magnam ut corrupti ullam temporibus rem provident ad consectetur corporis vero impedit cumque aut explicabo aut magnam nemo sequi dolores similique omnis molestiae cum exercitationem possimus similique fugiat sit debitis animi perspiciatis voluptatem nostrum laudantium voluptatem ipsum quo ducimus ad ad aperiam harum quas dolores dignissimos sapiente sit dolorem ipsam amet et ipsum inventore corporis omnis ab nostrum