INSERT INTO `course_news` VALUES ('192', '9', 'Earum iure quis qui eum.', 'Assumenda et magni id ut dolores ut dolores cupiditate id beatae aspernatur quod quod aut et omnis neque facere eveniet est voluptatem reprehenderit ipsum eum ipsum doloribus rerum sed repudiandae aut aut voluptatem nulla architecto perspiciatis omnis dicta ut reiciendis ea maxime laboriosam placeat et ea sed distinctio quasi esse accusamus voluptatem molestiae quos aliquid at voluptatibus ipsa quis dolorum cumque quia aut illo quas et inventore neque natus sit voluptatem voluptate et maiores nisi et repellendus qui sit aspernatur itaque dolores quam quam accusantium id veritatis quo ea est rem et exercitationem ducimus aspernatur ea minus maiores ut ea sunt ducimus sunt ex quae voluptas omnis ut est quo unde aut officiis iste ea minus dolorem beatae ex aut assumenda veritatis fuga non nihil laborum autem aspernatur excepturi fugiat commodi assumenda fuga aut sint qui omnis quae quisquam tempora illo ut alias qui minima dicta omnis nesciunt corrupti sit ullam maxime perspiciatis odit dolorem qui rerum exercitationem velit qui repudiandae repellendus aliquam in recusandae enim nemo nobis voluptas in sint qui et quia harum iure quisquam quaerat placeat ipsa nostrum quos blanditiis veniam dolorem necessitatibus consequatur eaque modi est sed ipsam a deserunt pariatur nihil.', '1', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('193', '4', 'Dolore delectus eligendi fugit ad beatae nihil aut.', 'Est ea vitae ut dolore labore voluptas a veniam sed temporibus ut est corrupti cupiditate repudiandae sit quia natus ea illum maxime commodi veritatis porro possimus nam odio quos eum neque enim incidunt error et magni earum temporibus possimus vel architecto eligendi nisi nisi deleniti amet ut libero cum et incidunt quaerat ullam quibusdam earum et doloribus ullam nemo est suscipit aut autem molestias ut ipsam autem autem sit hic vero et maxime aspernatur ullam facere sed repellendus eos magni atque in consequatur fuga tenetur ad praesentium et cupiditate animi ipsam dicta omnis repellendus perspiciatis distinctio rerum animi repellendus voluptas incidunt est nobis vel similique itaque est aut quis laudantium nesciunt voluptate amet et vel saepe omnis voluptatem voluptatem repellat omnis aut sit eos dolores doloremque veniam qui aut maxime ut esse animi sapiente porro ut nisi quod autem debitis laboriosam delectus labore omnis quos iure sunt nesciunt voluptate vitae pariatur veritatis voluptas odit ut culpa ut voluptatem vitae ad officia magnam ratione consequatur magni ipsum repellat qui in dolorem dolor sint quo eaque consequatur non cum modi enim expedita explicabo nulla voluptatem sed possimus cupiditate quia velit quisquam est reprehenderit accusantium magni adipisci ipsa laboriosam perspiciatis eius atque qui sed et iusto reiciendis cumque eius et repellendus repellendus ad vel libero et debitis ut ullam totam eveniet nulla beatae dolore ea quia ratione ut quidem recusandae dolorem vero repellat ea aut ratione qui sit delectus autem nihil eaque quis qui et voluptas delectus molestiae dolorum blanditiis sit totam doloremque quia itaque voluptas nisi sit dolor quia voluptatem saepe autem deserunt veniam in at et reiciendis assumenda expedita et quia est repudiandae in iure vel quos at cumque ipsam veniam quam quas nesciunt alias dolore ut quis magni saepe molli