INSERT INTO `course_news` VALUES ('194', '8', 'Molestiae libero sunt dolor.', 'Quisquam rerum rerum nisi voluptates et perspiciatis temporibus est aut consectetur quo sed architecto rerum sapiente temporibus magnam labore a in praesentium aperiam animi ut ipsam nihil magni sit iure vitae voluptas consequatur animi quo dolore omnis et neque ea quos nulla aspernatur vitae maxime sed a inventore non tempora modi sit et quis dolor rerum eos velit optio distinctio adipisci dolorem necessitatibus ex nostrum natus minus molestiae deserunt perferendis error veniam saepe rem maiores sint aut voluptatem accusantium debitis qui nihil ducimus ut eaque molestiae libero corrupti aliquid necessitatibus consectetur qui numquam exercitationem repellat eos rerum sapiente aut voluptatem architecto et animi nobis eligendi perferendis quo facere id unde veniam quia repellat animi unde rerum dignissimos ipsa fugiat earum illo rerum deserunt exercitationem nihil sit sed omnis quod rem doloremque similique vero inventore veritatis earum temporibus enim blanditiis explicabo non odio fuga mollitia sapiente quia minima pariatur voluptatum voluptates pariatur et est recusandae dolorum omnis libero aspernatur et repellendus quo porro autem quis est vel odit id cumque sit quam aut quam magni occaecati optio ut ipsum nihil dolores et error ut et aliquam quam dolor dolores dolore et qui consectetur excepturi laboriosam aut distinctio maiores ratione quos maiores et fugiat sit blanditiis officiis aut nihil eligendi dolorem neque maxime nostrum laborum sit harum ad ea et quia vel consequatur esse sit natus veritatis dolor consequatur velit nihil aspernatur iste autem quaerat voluptas totam sed molestias corrupti.', '0', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('195', '3', 'Repudiandae facere deserunt rerum et.', 'Perferendis quod voluptatem neque sunt quis perspiciatis quo impedit blanditiis autem voluptatum qui unde commodi molestias ratione sunt ipsam nemo sint quisquam sed qui ratione rerum rerum rerum voluptate est atque sapiente aut eaque reprehenderit aut assumenda ab commodi accusamus eius qui officiis rerum vel qui amet voluptatum quia dolor ut laborum quia aliquam omnis ut iure eum rerum quas omnis et consequatur enim est nulla rerum rerum rerum eveniet vel quo dicta consequuntur voluptates dolorem voluptatem et dolor amet ea sit rerum voluptatem quisquam id odio enim provident aut sapiente minus ut animi omnis est corrupti iusto earum atque est magnam exercitationem occaecati nam sit et et quas iusto officiis enim reiciendis magni sed numquam et veniam blanditiis ut dolor eum nobis odit minus veniam qui enim cupiditate ea commodi voluptatum aut qui minus nihil enim est recusandae quia voluptate quo autem suscipit placeat culpa laborum consequatur adipisci ab in repellat consequatur maiores amet sed eveniet sunt dolorem voluptatem ducimus deserunt repellat delectus laboriosam eaque est doloribus accusamus sed dolorem veritatis et dolore quod atque aut rem delectus voluptas unde nihil voluptatem non delectus beatae ut ea natus veritatis explicabo perferendis aut doloremque quae rem fuga voluptatibus sint debitis dolorem dolores sunt architecto et rem placeat ut nam ratione sint quas sed quae dolorem deserunt dolorem aut amet enim sunt sit esse dicta facilis atque veritatis ut distinctio quae voluptas iusto iste deleniti optio labore voluptatem totam provident quis odit sit architecto cum quam dolore omnis id ab sed error iure aut quod consequuntur aut molestiae laboriosam laboriosam qui quibusdam aut rem laborum qui qui maxime repellat et voluptatibus ea ut non dolorem quia non nostrum facere dolorum et similique consequuntur reiciendis et ipsa est quo sit quidem repudiandae aliqu