INSERT INTO `course_news` VALUES ('196', '5', 'Odio quasi nihil possimus eveniet.', 'Maiores a officiis voluptates similique enim et quibusdam optio error impedit aut ut quis dolor nostrum eos optio eius voluptatem unde autem dolores maiores expedita ullam quae quia aliquam et neque et quis est maxime placeat nisi velit quod tempore odio praesentium tenetur a sapiente sit sit tempore qui veritatis consequatur doloribus et qui porro et blanditiis atque occaecati quaerat perferendis laborum dicta nostrum unde vel ex molestiae qui doloribus aliquam occaecati officia et natus alias officia in in voluptatem nesciunt eaque totam sed inventore ratione minima ratione voluptatibus fugit voluptates animi occaecati totam quam et debitis numquam ad aperiam rerum necessitatibus sed qui eligendi natus quis sit reprehenderit harum minima officia vel rem recusandae at doloribus veniam neque saepe vero aut sint numquam delectus est et dignissimos labore dolorem perspiciatis ullam ullam veniam doloremque quos omnis quod enim ut autem maiores quia cupiditate temporibus ipsum qui dolor possimus non deserunt sequi non quibusdam vero at perferendis sit quis tempore animi beatae est et vel vel in ab consequatur impedit corporis dolorem magnam voluptates earum dignissimos aut delectus neque quo libero illo harum mollitia et et et eum nulla aut omnis soluta quaerat odit dolorem id est illum dicta velit et iste vel voluptas qui quaerat molestias ratione.', '1', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('197', '9', 'Totam sunt reiciendis ut asperiores provident vel.', 'Omnis beatae et fuga ipsam facere occaecati nulla maxime iste officiis eos magni officia iure corporis et ad rem saepe praesentium officia eum quis et qui laborum temporibus accusantium quasi est nulla enim nesciunt excepturi dignissimos fugiat quaerat quisquam asperiores cumque velit maiores error eos aperiam illum architecto autem provident perspiciatis beatae officiis molestias laborum maxime facere autem eos modi eligendi reprehenderit dignissimos id aut voluptatem voluptas architecto ut voluptatem minima et aut sunt error enim laboriosam iste expedita adipisci praesentium sed eos velit voluptatem corrupti vel ab neque odio autem et ut consequatur ducimus magni autem repellendus voluptas consequatur ipsum non vitae maxime consequuntur impedit placeat qui in aspernatur ex excepturi architecto itaque est aut rerum in dolores corrupti earum et soluta tempora id aut voluptas et veniam voluptatum voluptate ullam illum est placeat illum ratione ut magnam velit fugit recusandae deserunt consectetur mollitia dolorem autem corporis in architecto omnis beatae repellat quos quidem eum voluptatem unde tempora culpa ut aut enim ullam cumque sed laboriosam magni quo eos minus veritatis omnis iure est aut nulla qui pariatur error ut ducimus dolorem maiores eaque ut amet.', '1', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('198', '1', 'Ipsum sed placeat neque commodi aut ea sed temporibus.', 'Dolorum ratione dolorum unde et dolor enim deleniti sit eum architecto est iusto dolores expedita voluptatem itaque sint similique ratione explicabo quam possimus consequatur beatae occaecati voluptatum quam vero excepturi cum enim iste et molestiae numquam doloribus rerum corrupti nemo molestiae officiis rerum at voluptas dolores atque ut sit tempora sed ipsum rem non sapiente delectus ipsa iste velit eum eum molestias facilis debitis qui voluptas a odit repellat aspernatur aut qui aut facere sit veritatis culpa laboriosam delectus aspernatur a facilis et commodi nulla repellendus dignissimos rerum fuga est dolores numquam suscipit ratione est et cum qui explicabo iste ipsum optio quia quas ratione quod aliquam occaecati temporibus ducimus aperiam repellat aliquid sint facere non tempore praesentium velit autem in fugit aut esse fuga porro doloribus voluptatem eaque fugiat esse sint quis accusamus quibusdam non id ut et consequatur quia blanditiis temporibus culpa sunt inventore sed nostrum non voluptas voluptate ut dolores dolores est nihil magni sed qui vitae aperiam iste vel assumenda est at nemo ipsum rerum dolorum a doloribus modi eveniet sunt quia adipisci ab nisi eum et culpa omnis ut autem voluptas doloremque quo aut impedit dolor rerum sit fugiat commodi provident porro sed voluptatibus nihil deserunt aut similique eius natus minima inventore aperiam.', '1', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('199', '9', 'Est necessitatibus qui maiores laudantium qui nihil tempora rerum.', 'Consectetur consequatur similique earum aut autem et perferendis consectetur sit in delectus nobis enim qui quas aut rerum ad incidunt adipisci est sed iure qui tempora eveniet ipsam repellat impedit delectus atque nihil cumque commodi id nihil a nulla non iusto magni non vel harum tempore ut ea quaerat commodi vitae perspiciatis recusandae error maxime nihil vitae nemo error quam consequuntur assumenda enim doloremque quos perspiciatis aut molestiae eius amet et officia dolor fugit ipsam ut ut ut voluptates quia consequatur ut est rerum fugit in et natus velit provident saepe eos est doloremque eum quisquam debitis nostrum deserunt occaecati rerum et a esse itaque quia deleniti omnis natus et quo rerum aperiam ratione magnam unde aspernatur quia esse vero laudantium odit enim omnis nobis ea quos laudantium est et ut voluptatum omnis maiores et assumenda et maiores autem iusto assumenda optio expedita quaerat sunt omnis rerum fugit ea et aspernatur consequatur qui molestiae nulla temporibus dicta eligendi aut vel officia ducimus recusandae tempore maxime consequatur consequuntur doloribus unde debitis perferendis consequatur pariatur voluptatem iure et delectus vero magnam ratione eaque laudantium placeat qui voluptatem odit modi possimus a aperiam officia qui delectus tenetur autem vel aut minima quisquam et rerum repudiandae sit voluptas tempora cumque rem cum dolorum possimus provident hic ut nobis perferendis amet repellat ducimus in beatae quia voluptas praesentium minus et soluta iusto sed illo veniam atque animi quia et rerum velit omnis qui aut odit enim totam qui labore a quod dolor.', '0', '2017-05-02 22:58:54', '2017-05-02 22:58:54');
INSERT INTO `course_news` VALUES ('200', '9', 'Modi cumque rerum consequatur cumque eum vel.', 'Ea voluptas incidunt dignissimos nostrum nisi vel pariatur et ea veritatis quod repellendus soluta et qui et corporis dicta tempore voluptatum soluta et quos animi perferendis ut ut voluptatem illum qui incidunt hic ut vel ut quae soluta qui aliquid id aperiam alias culpa voluptatem totam ratione sunt earum aperiam quia odit deleniti voluptas quas eveniet repellendus adipisci voluptatem culpa vel saepe ea ut et nemo et in recusandae amet ut aut quibusdam aliquid voluptates aliquid minus dicta reiciendis cum deleniti quo est accusantium aliquam neque impedit dignissimos dolore qui reiciendis voluptas voluptas qui adipisci qui eos cumque dolor ab architecto mollitia dolorum perferendis qui ut ratione veniam mollitia veritatis quia rem qui numquam harum dolores sit voluptas quibusdam voluptatum quisquam rem corporis soluta a fugit earum quaerat corrupti ut culpa repellendus autem et sed optio quaerat asperiores minus officiis iure aut perferendis cum dignissimos ab architecto aut dolor magni veniam autem error qui harum enim iusto eos qui voluptatibus sint soluta rerum laborum dignissimos blanditiis consequuntur labore quos vero ut non repellendus quia voluptas deserunt corporis temporibus perferendis iusto sit nesciunt amet maiores sed velit vel facere fuga quis odit sint labore ut qui doloribus sint delectus porro ea illum eligendi laudantium animi quos exercitationem unde consequatur beatae explicabo odit veritatis repellat consequatur in perspiciatis eligendi temporibus molestias soluta aut itaque numquam ut inventore necessitatibus aut rem rerum nostrum sunt et voluptatem dolorum odit iure molestiae numquam ea sed et.', '0', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('201', '1', 'Incidunt necessitatibus autem et dolorem eum.', 'Qui facere omnis aliquid numquam assumenda assumenda deleniti ut dolore perferendis nostrum quia blanditiis accusamus dicta rerum earum et vel eum ut cupiditate quidem et ut et velit sint eligendi voluptas dolor sunt quo numquam voluptatem non officiis quis veniam omnis sed sed est facilis sunt aut porro nihil est totam cupiditate perspiciatis ipsa consectetur ad veniam ducimus praesentium voluptatibus beatae omnis dolor odio nulla placeat beatae magnam tenetur vero dolor magni sunt expedita voluptatem et blanditiis et aspernatur saepe facilis ut cum vitae ut pariatur similique quisquam esse molestiae officia molestiae et ut aut recusandae modi qui animi ut quibusdam sed porro eos harum quia commodi quia sapiente cupiditate placeat necessitatibus delectus eligendi distinctio autem et soluta sit autem esse dicta consequatur necessitatibus et autem quidem fugit tempore quis dolores maiores sed natus ea officiis id harum occaecati velit illum perspiciatis autem nulla asperiores corporis aperiam veniam quia hic natus quia odio vel est assumenda voluptates dolore vero ut culpa sunt ea debitis molestiae optio sint sunt sed et et temporibus qui molestias quibusdam ratione sunt voluptates quasi aut labore quam facere veritatis officia dolorum laborum voluptas neque et esse est cumque consequatur consequatur dolor earum quidem sed voluptas accusantium porro a debitis velit dolore animi sed commodi magni optio dolores repellendus qui mollitia est sit voluptatem quod animi illo quae non voluptatem sint ab aut odio inventore consequatur sunt optio minima voluptas facere quis repudiandae consectetur beatae amet rerum eum dolor quae at est consequatur eius dolores enim tempora a quibusdam atque illum assumenda vel odit sit.', '0', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('202', '7', 'Sint voluptate aut tenetur fugit est quidem.', 'Dolores quaerat illum laudantium quo cupiditate laboriosam maiores non eos consectetur sunt aut occaecati laudantium adipisci aut minus placeat labore dolore et voluptatem tenetur vel nisi neque est consequatur debitis delectus dolores veritatis natus ratione et optio sint odit perferendis aut sunt voluptas nemo quia qui mollitia expedita qui qui quaerat officiis neque aperiam incidunt illum culpa consequuntur eius praesentium eos repudiandae sed ut repellendus dolor officia maiores illo aspernatur odio dolores et blanditiis porro perferendis enim officia cupiditate neque omnis delectus alias harum error et tempore iste iusto nam ut expedita totam expedita consequatur quaerat ipsum optio odit voluptatem minima dicta asperiores quis adipisci minima id quo sit quam ad voluptatem animi fugit molestias molestias sit porro nobis placeat occaecati sit reiciendis voluptate reprehenderit autem labore sit in facilis nisi qui adipisci est eveniet eum molestias numquam et doloribus corporis autem voluptatem aliquam dolores est accusantium ipsum ut aspernatur rem sunt rerum amet unde ratione pariatur perferendis reiciendis quas quaerat corporis provident veritatis alias doloremque est optio reiciendis ex veritatis quia et corrupti aut deserunt rerum ut unde fugiat facere omnis rerum tempore et rem similique voluptatem necessitatibus ratione sed sed excepturi ut iure itaque libero iste voluptatibus culpa voluptatem sed amet alias voluptatum accusamus et qui et sint rem nulla ipsam esse voluptas et perferendis vero reiciendis facilis laborum et perspiciatis ut est porro odio est ut facilis officiis molestiae doloribus dignissimos aut enim laborum eius voluptas nostrum non aliquam consectetur eum quam omnis laborum nihil cupiditate eos architecto suscipit dolore sed qui voluptas aut deleniti itaque nesciunt quia consequatur fugit consectetur est ab blanditiis sed ipsum omnis laboriosam a