INSERT INTO `course_news` VALUES ('203', '10', 'Dignissimos quam consequuntur consectetur omnis et doloremque cupiditate.', 'Quia laborum odit eum iusto ullam aperiam sint culpa harum cumque atque alias quaerat est adipisci officiis labore autem optio vero voluptatum impedit expedita dolor deserunt ut error ipsum nesciunt architecto voluptatem ut ut voluptatem est error ea maiores sit non nihil autem eveniet quam odit sapiente ut ut veritatis aut aperiam aut incidunt molestiae at adipisci rerum voluptatem impedit quasi qui quia qui voluptatibus nihil alias quod quia optio quaerat reiciendis nemo fuga distinctio accusamus est non excepturi deleniti et quas repudiandae repudiandae optio et ipsa cum non doloribus voluptate recusandae perferendis et porro facere excepturi doloremque aut velit distinctio ut enim fugiat sit ad accusantium deleniti assumenda molestiae veniam possimus animi similique aspernatur sit qui recusandae quia et laboriosam atque placeat atque minus quas repellendus ea amet fugiat accusantium est laudantium cupiditate sed molestiae ab consequatur dolorum est quae eligendi quis aut est numquam nam sunt deleniti explicabo doloremque repellendus sed explicabo asperiores qui nam cum beatae officiis et laboriosam quis minima molestiae atque qui officiis nisi qui enim consequatur eum exercitationem eos iusto fuga corporis omnis aut magni deserunt repudiandae ut animi sit omnis sint quas sint atque aut quia nostrum quo tenetur est eveniet mollitia.', '1', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('204', '1', 'Et accusamus fugiat quis impedit consequatur.', 'Nostrum amet et sint inventore iste omnis vel sed harum alias harum suscipit quidem odit et possimus optio quisquam quisquam numquam doloribus dolorem rerum sed veniam sed alias aliquam laborum alias cupiditate aut recusandae reiciendis amet et et et sed non praesentium iste aut tempore at exercitationem nisi amet tempore recusandae est consequatur facere deleniti itaque laboriosam qui veniam illum laboriosam libero et fuga qui accusamus officiis distinctio ipsam quia velit et impedit corporis nihil quis ut repudiandae non id eos reprehenderit sunt maxime debitis aliquam sunt qui perferendis quaerat quidem eos voluptatem laborum ipsa saepe excepturi magnam expedita at omnis sit quae in numquam maiores possimus dolor architecto sit culpa consequatur ad magnam consequatur blanditiis qui animi tenetur minima est tenetur adipisci est aspernatur fugiat quisquam vel est a ipsa aliquid id similique non quibusdam sed minima nihil excepturi aut vero eum neque sed dolorum repellat numquam velit id nobis repellat placeat consequatur illo consequatur saepe perspiciatis eligendi velit voluptas quia architecto voluptas ex iure inventore consectetur sit nesciunt autem eius velit laudantium suscipit adipisci iusto deserunt accusantium alias in quibusdam at magnam sunt sit earum quia quidem quis et numquam sed fugiat voluptas voluptatem voluptatem perspiciatis reiciendis exercitationem tenetur voluptatem eveniet eum distinctio expedita explicabo ut autem soluta consequatur quia corrupti quis vel quia sit ab dignissimos non consequatur aut dolores magni delectus et impedit eos voluptatem exercitationem tempore et neque itaque sequi et facere asperiores eveniet eaque maxime quo dolores id aliquid dolore amet cupiditate exercitationem velit corporis enim qui delectus nobis sint consectetur et veniam harum incidunt et odio non nobis accusantium aut dicta aut accusamus aut a culpa sunt placeat