INSERT INTO `course_news` VALUES ('205', '4', 'Fugiat possimus ipsa quae commodi ipsum.', 'Molestiae ducimus cum aut voluptatem omnis quis voluptas dolorem laudantium minus velit labore magnam dicta in accusantium et dolor aut commodi iusto vero est aperiam voluptate quos odit distinctio aut qui at adipisci animi sed tempora non enim in beatae sequi nam aut alias et eius ab optio et ut et dolorem exercitationem assumenda qui reprehenderit dicta quae qui dolores et voluptatem ut perferendis laborum nostrum sint dolorum enim odio repellendus nostrum et fuga libero ex accusantium iste blanditiis ad quam et accusantium aut tenetur a voluptatem quos veritatis odio rerum ab animi aliquid exercitationem a fugiat molestiae nesciunt et voluptatem a in beatae provident temporibus non vel magni doloremque modi ipsam voluptatibus dolor dolores corrupti porro quia nesciunt eum quo est sed hic ea aspernatur veritatis a ab dolorem ab soluta eius sed quia dicta officia eaque a est voluptatem cupiditate nesciunt ex rerum recusandae fuga perspiciatis dolore et voluptates dignissimos est quis aut hic molestiae omnis ab quis in rerum natus est aut quo laborum ipsum ut ut quae dolorem eos consequatur molestias quae sit sint velit eveniet similique distinctio nihil tenetur doloremque fugiat alias voluptate qui assumenda et sit rerum qui in autem natus tempora delectus architecto suscipit ullam veritatis suscipit aut amet ullam nemo porro beatae deserunt laboriosam nihil vel odio consequuntur accusantium deleniti vel dolores quia illum voluptas quis fugiat voluptas voluptates ut deleniti officiis sit suscipit amet sit dignissimos itaque eum nobis a impedit explicabo adipisci sunt dolor dicta et quis dolore nam voluptatum eligendi ut eos excepturi molestiae vitae illo nemo itaque in qui voluptatem eum aut aspernatur est magni voluptatibus et laudantium quaerat eos nobis debitis eveniet repellat fuga ex omnis voluptatem quo eum placeat quo qui omnis et vel architecto saepe commodi ea eaque fugiat qui qui qui maiores temporibus ea porro enim eos aut eos vel asperiores quis enim aspernatur atque ut nemo praesentium dolores ipsa eius eos praesentium dolorem eligendi hic.', '1', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('206', '3', 'Ut ratione consequatur dolores est repellendus qui.', 'Molestiae quasi dolorum esse sed dolor ea fugit non in ipsa inventore vel velit voluptatem dolore qui non maiores odit perspiciatis beatae totam ipsa ab repellendus sed officiis minus dolor reprehenderit iste vitae cum quibusdam eveniet sunt labore error quo maxime quo nihil nulla sed qui iusto molestias provident rerum amet eos perspiciatis sunt sed neque aut voluptas eos enim in doloremque tempora molestiae sed excepturi cupiditate ut esse velit nihil asperiores ipsa velit sit eveniet et rem accusamus accusamus at minima aliquid veritatis at esse debitis quae reiciendis aut temporibus dolor laudantium adipisci sit ut ut neque eius ducimus possimus non neque eius iure cum qui officiis quam explicabo vel et voluptatem nostrum tempore saepe aut consequatur occaecati velit dolorum voluptatem esse consequatur est aspernatur ratione est adipisci et eveniet exercitationem nesciunt quo neque atque et enim omnis numquam sed quaerat est itaque tempore incidunt debitis omnis reprehenderit iure dolores similique eos ab voluptatem sed accusantium in facere eaque rem veritatis rerum esse soluta ex non delectus animi ut sint est sapiente laborum et sit odit harum sed optio doloribus consequuntur animi quo laudantium cum voluptatem repellendus eveniet consequatur ad in maxime aperiam nesciunt aperiam et sapiente dolorem culpa blanditiis ab quaerat sapiente consectetur sed velit esse exercitationem molestias nisi et non illum et ducimus laboriosam nostrum vel ullam rem reiciendis aut eaque accusamus voluptatibus consequuntur ut atque nisi quibusdam dolorum debitis enim deserunt quos officia eveniet dolorem ad repellendus soluta voluptas quaerat qui consequatur aperiam cumque excepturi modi molestias qui eligendi rerum rerum est reprehenderit expedita quam qui ipsum est facere labore magnam ullam fugit mollitia quis corporis velit quia in ipsum nulla beatae et vel dolor provident a