INSERT INTO `course_news` VALUES ('207', '10', 'Illum ea sint porro id quis provident.', 'Similique voluptas qui facere a quia laudantium id autem cupiditate et dicta distinctio sit unde in enim explicabo quia itaque rerum sequi aspernatur rerum repellat fuga ut ullam excepturi sed cupiditate qui qui autem qui fugiat consectetur illum aliquam facere quia tempore eaque sint dolorum itaque et velit aperiam animi iusto temporibus quod aut incidunt voluptatem explicabo et minus sequi veritatis alias fugit atque labore veniam a consequuntur quam dignissimos et aut commodi adipisci voluptatem in quo provident nam doloribus qui consequuntur sit et id eius sed consectetur eveniet iste consequatur et nihil nostrum autem quod minima odio qui ex fugit quia quia quasi enim possimus culpa dolorum itaque mollitia corporis odio aut quas ratione rem est iure veniam incidunt ipsam harum sit perspiciatis culpa aut facere ipsa dolor quasi rerum quis dolorum est maiores quas omnis aspernatur ut inventore dolor rerum velit qui nostrum voluptas ipsam ullam rerum esse qui ea harum voluptatem ipsa molestiae sunt doloremque consequatur assumenda pariatur voluptates sint doloremque occaecati aliquid nam optio adipisci neque quam accusantium minus odit tenetur maiores nam facilis pariatur aperiam officia consequatur voluptatem commodi rerum aut voluptatem molestiae omnis est porro autem et consequatur quia officia eaque eligendi autem aut dolorem ut in consectetur aut impedit quas eos.', '0', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('208', '2', 'Voluptatem nemo quibusdam autem earum.', 'Quod dolor enim ex at itaque totam mollitia dolorem eos sit quia nam et consequatur non repellendus et ea sit provident a perferendis maiores eum id eos laudantium iusto similique iste sed eos ipsum saepe beatae et et pariatur est ullam expedita excepturi eum et dolorem tempora a quo inventore odio ea accusantium error vitae harum maxime a ducimus possimus tenetur in porro exercitationem assumenda est quae ea fugiat iste ut amet voluptatum non aut aut quaerat sapiente sunt accusantium voluptatibus qui illum quaerat quia ullam error a molestiae odit voluptate et quia veniam et porro est blanditiis provident similique aliquam aut est et harum dolorem magnam blanditiis voluptate tempore et magnam et excepturi optio a excepturi unde ut nesciunt aut voluptatem suscipit eos at autem aut vero qui repudiandae aut est nihil ut tenetur dolor est sint consequuntur sit cum eum labore praesentium est illum possimus enim sint expedita impedit nihil odio quaerat quos nulla debitis repellat est praesentium illum assumenda velit est accusantium ad eum eos nemo ipsam iste nihil ut voluptas consequatur natus eligendi laudantium nemo molestiae in libero aperiam perspiciatis ab nobis ducimus aut vel et velit consequatur corrupti odit quasi odio quae minus itaque voluptatem assumenda aliquam animi ea vitae nobis eius earum aut consequatur magni et dolorem nihil non ut accusamus esse voluptates quibusdam at ea praesentium illo officia voluptatibus et ratione ducimus reprehenderit sed laborum officiis recusandae ad unde sint sed consequuntur explicabo minus harum debitis explicabo assumenda itaque a omnis tempora expedita ab sit est voluptatibus voluptatem aspernatur ut pariatur nisi repellendus amet est non recusandae non omnis labore id aspernatur consequuntur repellendus a sunt eius fugiat sunt eius consequatur voluptatem voluptatum fuga nulla esse veritatis recusandae consequuntur vel dolorem volup