INSERT INTO `course_news` VALUES ('209', '4', 'Ab qui ipsa nam odit.', 'Et ut voluptatum est modi inventore quo qui doloremque assumenda quos blanditiis dolorum enim odit nostrum eligendi impedit qui voluptatum non culpa omnis necessitatibus placeat dolorem quis libero dignissimos doloribus iusto velit quia aliquid dolor modi architecto tempore animi dolorem quibusdam molestiae et at aut repellat rem provident quibusdam eum et ipsam illo voluptatibus fugiat quia voluptas veritatis eos soluta omnis eos nulla non id minima dolores qui ea officia quaerat odit dolorem animi aut ea non voluptates qui eos autem asperiores quia ducimus saepe eveniet est itaque qui fuga omnis molestias possimus dignissimos fugiat nemo ea consequatur fugit consequatur et est ipsam qui dolores at nostrum commodi aut ratione cupiditate et quis et est laboriosam dolore aut fugiat quibusdam ut ad non adipisci ut qui sed illo dolor laboriosam ea non libero nobis nihil temporibus aut sed eum ipsa enim quos qui explicabo exercitationem in quas quod culpa voluptatum sequi assumenda a sapiente quae laborum error est enim asperiores atque molestias facere mollitia aut provident et autem placeat omnis corporis nesciunt nihil consequatur aperiam quasi totam voluptatem culpa esse aut quis deserunt est expedita sed non ut aut nostrum odit tenetur a nihil quidem corrupti unde quia recusandae quibusdam alias non distinctio totam facilis ut et rerum porro maiores atque similique sunt reiciendis tenetur quod ad et omnis eum ab quia quia dolor minus iusto quae id hic excepturi est et animi consectetur laudantium earum nisi et alias inventore esse in maxime illo aliquam ut non suscipit asperiores blanditiis quas neque dolorem eum deleniti vel quam sequi atque et nihil aut consequatur qui enim molestias aut possimus aut ut autem autem sapiente aperiam blanditiis fugiat quaerat necessitatibus quis ad voluptas non perspiciatis voluptas ipsam non officiis dignissimos non.', '1', '2017-05-02 22:58:55', '2017-05-02 2