INSERT INTO `course_news` VALUES ('210', '8', 'Ratione dolorum quidem voluptates et quaerat aspernatur.', 'Pariatur labore et dolor inventore suscipit debitis expedita placeat ut eaque corporis eos consequuntur aut voluptatem blanditiis enim ut minus odit repellendus qui esse non suscipit fugiat voluptates qui ut consectetur porro eaque ut esse et ut maiores error nulla dolorum vel ut ut impedit quo ut tenetur et voluptatem architecto tempore ut doloribus libero asperiores excepturi vel veniam qui sunt tenetur et laborum praesentium doloribus labore soluta sapiente laudantium suscipit dicta nulla libero aut in aut quis voluptas sequi et sint nulla alias aliquid ratione porro vitae saepe sint tempora animi sed sed possimus sint soluta fugit eius harum quo omnis quia quisquam non cupiditate et vel magnam quisquam et ipsam et velit quaerat minus esse nam odio sed vel porro quos reprehenderit recusandae animi ipsa natus reiciendis deleniti officiis molestiae repellat quaerat cum fuga molestiae ut sit velit voluptate molestias libero autem libero sint laborum minus recusandae et sequi ab earum reprehenderit ab animi expedita porro nesciunt quia adipisci rerum ratione fugit veritatis quis sint quaerat accusantium et eaque accusamus et et illum et ullam totam doloribus quo id sint hic animi qui nisi consequatur repudiandae exercitationem ipsam dolores omnis magnam architecto facilis nihil voluptatibus nihil dolorum labore eum et aut qui ducimus quis totam et rerum ut fugiat aliquam eos quibusdam consequatur neque reiciendis inventore dignissimos rerum optio totam eum est eius porro quo consequuntur ab incidunt fuga veniam magni eos debitis quia mollitia et qui qui aliquam quas itaque officiis voluptatum pariatur temporibus explicabo aut ab aut minus mollitia officiis explicabo animi aspernatur dolor ut placeat provident velit aspernatur dolorem vel modi ab ut et error voluptatem qui et suscipit neque error voluptatem eligendi eos laudantium inventore aut quia fugit delectus delectus tempore sint eaque necessitatibus quaerat consectetur voluptatibus laudantium excepturi laboriosam deserunt aliquid quis temporibus dignissimos accusamus dolor quae ut ut nemo consectetur voluptatem molestiae labore rerum ea animi omnis quis sit enim saepe voluptates repellat autem ut unde quo illo molestiae id dolorem dolores sit ad velit aspernatur sed aut fugit dolor est pariatur quos voluptatem sed consequuntur libero eum commodi sapiente quibusdam rem omnis quia quaerat itaque tempora et tempore repellendus consequatur est ea dolorem laborum dolor recusandae eos iusto neque quod eveniet quia occaecati omnis odio voluptatem adipisci eum est libero velit aut qui necessitatibus ad libero quibusdam tempora ut et et officiis odit omnis quas quia eius omnis omnis dolores praesentium et accusantium reiciendis ad dolorum omnis tempora inventore eos.', '1', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('211', '8', 'Accusamus nam aut et quia amet et magni.', 'Aperiam eligendi sit praesentium nesciunt laboriosam laudantium sunt ipsam dolorem nesciunt amet harum cupiditate ut voluptatibus et similique mollitia ea officiis aut dicta consectetur aliquid ut repellat mollitia non velit dolor adipisci necessitatibus voluptas consequatur dolor consequatur esse consequuntur id natus aliquid velit incidunt officia qui voluptatem commodi corrupti molestias in vel laboriosam quaerat maxime cupiditate aut et nesciunt et at incidunt eum eaque eaque nihil cupiditate architecto non ducimus incidunt impedit beatae provident voluptatem nam dolore maxime dolores enim distinctio dolorem aut velit quas nihil maiores veniam esse distinctio ad rem et ipsam voluptas possimus consequatur nulla tempore sed suscipit omnis quia molestiae accusamus minus quis enim ea incidunt recusandae enim sed labore enim aliquam fugit labore nisi saepe et repellat eveniet cumque nam quaerat sunt molestiae rerum adipisci et incidunt dolor et fuga illum sequi quo voluptas et ea fugiat nihil asperiores incidunt tenetur et nihil non consequuntur quia veniam ut ipsum quos occaecati labore id quia dolor nisi eligendi consequuntur consequuntur sint et labore in expedita eum minus excepturi aspernatur officiis ut possimus autem qui deserunt sed laborum aliquam vel aut aut excepturi asperiores non placeat doloribus voluptatem laudantium repellat quis quo aut corporis consectetur necessitatibus dolorem necessitatibus vel voluptatem enim et dolore adipisci est repellendus corrupti dolorem eaque numquam soluta et dignissimos alias sunt laboriosam voluptas nihil consequatur blanditiis iusto atque consequatur est qui quia sint consectetur et quo numquam vitae minus harum ut sapiente ut non ratione sed totam.', '0', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('212', '5', 'Libero iure quia aut non et voluptas molestiae.', 'Itaque quo error qui et debitis cumque sed eos eum quis asperiores id et commodi soluta labore omnis dolor deleniti nam quis quo enim veniam officiis suscipit voluptatem illo est reiciendis temporibus cupiditate itaque occaecati et odit rem sint dolor minus rem maxime ullam sapiente quidem hic ut delectus eum tempora tenetur eos alias quo mollitia consequatur omnis aut eos fugit magnam voluptatem nostrum consectetur rerum ut ut id est voluptatum rerum suscipit aliquam nihil a itaque illo veritatis optio hic consectetur ut aliquid aliquid quod voluptatem et molestiae voluptatem reiciendis veritatis aut non ut aliquid dolorem rerum ut qui qui voluptas et recusandae fugit sit voluptatem ut explicabo aspernatur facere laborum veniam asperiores et voluptate quibusdam doloremque maiores est architecto ut maxime nisi cumque hic quibusdam est voluptatibus sequi repudiandae dolores tenetur laborum consectetur nam dolores voluptates ad et aspernatur qui autem quia voluptas maxime sed nisi atque maxime quos eos sed pariatur id et tempore vitae molestiae dolorem non saepe similique nihil aut iure facere consequatur quisquam dolorem sed eligendi delectus quia voluptatem ut quia quo vel dolores praesentium.', '0', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('213', '4', 'Tempore sunt ipsam omnis est.', 'Enim necessitatibus et porro nobis eos praesentium totam impedit commodi qui dolorum laudantium iste quaerat recusandae corrupti excepturi doloremque animi suscipit qui et dolore id a blanditiis pariatur est molestiae rem iusto repellendus doloremque harum enim cum et voluptatem commodi dolorem nulla id molestias et quae sit modi sunt iste ipsam culpa voluptate odit neque atque aut nisi recusandae atque et sunt optio sit dolorem cumque iste eius facere voluptas quo vel harum aut laborum a delectus repudiandae quasi aut ab neque mollitia id labore ipsa nobis velit non ut sunt sunt rem culpa earum explicabo repudiandae aliquid tenetur eveniet possimus ipsum repudiandae ullam mollitia voluptatem voluptatibus aut possimus delectus ut tenetur nihil reprehenderit natus illo voluptas dignissimos fuga incidunt ut similique quia perspiciatis ab porro labore rem eligendi voluptate sed laboriosam id sequi dolorum nihil debitis odio vel et vel ut doloremque aliquid fuga nostrum accusamus dolorum quisquam molestiae dolorem eaque voluptas sequi labore voluptates ullam distinctio aliquam temporibus quisquam maxime doloremque assumenda perspiciatis natus repudiandae tempora qui asperiores non sed quis ab temporibus sit ducimus est esse in consequuntur sint voluptate aliquid doloremque illo omnis sed repellat voluptates et dolor nobis ipsa eum aut et nam cupiditate ut quam dolorem voluptas labore asperiores et eos cumque nulla minima ab ipsam corporis consectetur quae enim rem est repudiandae voluptatibus voluptatibus libero non sit quia error porro officiis eos ut velit nemo in quis aut accusantium laborum et dolor commodi in incidunt dolore autem deleniti recusandae et velit voluptatem voluptate in provident iusto omnis ducimus repellendus quia ut optio.', '1', '2017-05-02 22:58:55', '2017-05-02 22:58:55');
INSERT INTO `course_news` VALUES ('214', '8', 'Praesentium fuga eaque amet ut.', 'Distinctio accusantium placeat fugiat quia placeat quidem quibusdam consequatur nemo rerum porro nostrum dolores optio ut dolores ea et omnis quasi repudiandae omnis doloribus autem minus sunt nihil itaque et quidem adipisci sit velit beatae atque itaque ipsam ea ab iure laborum et optio laborum magnam nemo voluptatem eaque qui dolor tenetur consequuntur possimus hic asperiores earum mollitia ut velit distinctio praesentium in voluptas occaecati et numquam dolorem harum rerum ea culpa eos in quibusdam et nobis sit maxime mollitia quae veritatis delectus velit delectus magni laboriosam impedit aut est saepe consectetur vel enim quos vel aut nemo blanditiis placeat voluptas occaecati praesentium tempore est laborum vero maiores quod corporis explicabo velit itaque dolorem enim excepturi fuga vitae ipsum blanditiis explicabo sit qui consequuntur rem quas magnam est cupiditate voluptas consequatur eligendi eligendi deleniti temporibus numquam qui dicta voluptatibus mollitia itaque consequatur ipsum est nulla et qui qui et in est aliquam quia dolores neque iste illo harum voluptatem labore rerum qui rem quo labore voluptatem est illo et porro ad necessitatibus quia eaque placeat sit id ipsam id vitae excepturi iure et aliquid ut quo distinctio molestiae amet distinctio veniam occaecati repellat doloremque dolorem esse a ut animi quis culpa tempore alias eius ab voluptatem debitis debitis tempore provident quia tenetur facere voluptates commodi aut incidunt rerum fugiat esse ut unde dolorum quaerat praesentium voluptate corporis et qui excepturi labore vero ea nemo atque sint iste facilis occaecati vel accusamus necessitatibus et hic sunt illum necessitatibus doloremque dolorem autem adipisci impedit sunt quia quaerat quas dicta ut voluptatem nihil ut nobis a quia aut aperiam iusto eum expedita nulla omnis explicabo asperiores odio corporis officia quas temporibus enim in doloremque quia et 