INSERT INTO `course_news` VALUES ('215', '9', 'Sit ut et asperiores qui id aliquam.', 'Id consequatur in et similique eligendi velit quidem laborum quod dolor ut ut maiores aliquam vel fuga dolor consequatur qui est perferendis distinctio et adipisci doloribus nobis sint consequatur explicabo aperiam et dicta sed ut ad iste quibusdam quibusdam alias minima delectus natus fugiat aut sed facere odio at itaque minima natus et accusantium quia dolorum ex blanditiis ab quisquam accusantium recusandae ipsam autem quia explicabo culpa esse architecto reiciendis est culpa sed temporibus culpa ut a repudiandae et eum sunt rem eligendi sint numquam dolore perspiciatis a corporis illum minima quia veniam molestiae dolorum ut aspernatur voluptates omnis praesentium enim doloribus quia qui cupiditate et repellat soluta qui rerum esse et eos earum fuga ex voluptatem perferendis nulla quo temporibus facere cumque dicta eos nam consequatur aut facilis qui libero dolorem illum dignissimos magnam ducimus reiciendis corrupti quidem officiis aspernatur aspernatur accusamus eveniet ducimus cupiditate voluptatibus labore et dignissimos officiis nostrum consectetur doloremque ut dolor non delectus sapiente est laboriosam accusantium accusamus facilis et qui illum quam qui vitae earum nisi id ea similique tenetur quo sint quis officia eos voluptas quae facere impedit enim soluta inventore voluptates tempora tempore qui illum sit et tempore dolorum perspiciatis perspiciatis neque vel id repellat eaque ut consectetur et earum necessitatibus aut enim id libero facilis voluptatem modi voluptatem aut placeat nam pariatur debitis sed necessitatibus maiores hic nisi consectetur deserunt fuga qui excepturi est voluptates a nisi inventore aut magni fuga alias id rerum sint esse perspiciatis perferendis voluptatibus enim quo suscipit voluptate et quos veritatis quia enim dolores magnam ut rerum voluptas itaque nisi rerum earum ea inventore eveniet amet provident culpa non doloribus eligendi maxime a