INSERT INTO `course_news` VALUES ('216', '2', 'Ipsam reiciendis excepturi mollitia consequatur.', 'Atque temporibus accusamus aut id qui laudantium minus repellat voluptates animi adipisci animi exercitationem soluta odio sed aut accusantium quo facere ipsa voluptates commodi rem non quia qui harum et facere ut maxime occaecati veniam commodi doloremque eos nisi impedit voluptatem voluptates ab aut alias et aut iusto et tenetur quo doloremque eligendi possimus omnis deleniti quo et maxime expedita aut repellat ut commodi autem eum occaecati facere maxime dolor earum ipsum omnis beatae nemo tempora quis aut consequuntur voluptatibus sunt et magnam sunt totam aliquid dolores mollitia consequatur corrupti sint vel quia quae vel nemo doloribus expedita quam delectus perspiciatis amet perferendis quisquam ut quia et nam est cum vero numquam aliquid unde non vel officiis quo ipsum odit dolorem sed ut blanditiis architecto molestiae iure ratione maiores et quo quisquam sed quia fugiat dolorum et ex eius dolor ut voluptatum est qui sed nihil quod placeat sed aut sed ex quasi dolorem impedit ipsa quam non incidunt quam omnis dolor sint et alias voluptatem enim quaerat praesentium repellendus expedita eum impedit velit voluptates natus magnam excepturi velit in quia suscipit harum qui labore dicta eos ut illum quam natus ut labore reiciendis illum architecto aliquid veniam dolorum soluta consequatur officia et dolores unde laboriosam sint sed nihil incidunt quia et ut veritatis qui qui cupiditate cum voluptatibus esse ipsam voluptatem quia qui labore dolor non repudiandae maxime facilis vel fuga dolor nam impedit qui ipsa eveniet sit magnam dolores ea aut magnam et qui sapiente consectetur consequatur laborum quasi corrupti corporis officia totam non voluptates quis et aut facere reiciendis aliquid recusandae necessitatibus eum ab id voluptatem aut nam qui rerum cupiditate nisi recusandae ut adipisci qui sed soluta recusandae odit nulla harum earum excepturi optio quis eum omnis dolor iusto vitae omnis iusto illo veritatis praesentium animi expedita eos voluptatem voluptas consequuntur assumenda minima unde laudantium similique officia nam non officiis vel aperiam at dolor nam voluptatem ab nulla deserunt eaque sapiente ut debitis eos in ex asperiores vel est assumenda accusamus rerum ut sed veniam nostrum ea ad ut explicabo eos veritatis error qui repudiandae consequatur ea voluptatibus deleniti quae et autem vero nesciunt necessitatibus voluptas a non quia quo placeat harum quia pariatur assumenda commodi quia quibusdam dolores quis quam aut cupiditate amet incidunt excepturi laboriosam eaque qui ipsa quo dolorum necessitatibus enim maxime rerum qui dicta est mollitia soluta velit dolores est facilis ipsa ab qui minima repudiandae illo consequuntur.', '1', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('217', '3', 'Delectus aut excepturi aspernatur totam blanditiis.', 'A officiis suscipit est corporis necessitatibus qui aut cupiditate quo tenetur similique et suscipit est voluptatem beatae qui quo ipsa et quam incidunt ipsum sit ut laudantium perferendis minima impedit voluptates culpa sit rerum aliquid aut vel aliquam harum nostrum dolorem quis culpa veritatis unde vitae sapiente consequatur sunt voluptatem provident excepturi dolorem nesciunt dolor dolorem non ipsum beatae libero ullam hic soluta voluptate qui iste ea aut maiores veniam quo voluptas eligendi qui natus repellendus et minima magnam aliquid aut eos nesciunt accusamus eum cumque dicta ut numquam quae quas qui eum nisi libero ipsa laboriosam ea ipsum pariatur eos sed eos exercitationem sapiente fugiat officiis explicabo sed et iusto soluta qui a repudiandae et voluptatem voluptatem cumque odio veritatis quo est fugit numquam qui enim hic expedita accusantium quidem dolorem aspernatur laboriosam ea quam unde quisquam aliquid dolore unde quos aut repellat tenetur at repellat perspiciatis omnis natus qui mollitia similique sed voluptate eaque cupiditate natus est quae quod unde et maxime quia iusto sunt dicta nemo enim provident qui quod molestiae fugit pariatur eaque ipsum eos omnis nemo voluptas excepturi qui explicabo ipsa possimus veniam at dolor facere sed ratione tenetur culpa ducimus quibusdam ut rerum rerum sit voluptate voluptas eveniet ullam quam similique est sint labore occaecati et porro nisi odio dolores impedit eos dignissimos non dolorem impedit natus maxime error maiores sed neque aut earum excepturi suscipit id aperiam inventore minima eveniet odit consequatur est aliquid omnis excepturi molestiae iure dolore maiores autem esse sed sunt corporis explicabo fuga dicta facere voluptas provident reprehenderit quia impedit accusamus officia est at voluptatibus saepe tenetur nostrum vero in omnis est quia ad qui sed vel nobis laborum unde praesentium est molestiae quibusdam sit eligendi voluptatem dolorem et consectetur architecto dignissimos et quibusdam deleniti quos nulla explicabo ut voluptatem in facilis magnam magni adipisci ut laborum similique pariatur modi fugiat unde.', '1', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('218', '5', 'Inventore dolorum sequi culpa totam impedit.', 'Sit dolor et dolores accusantium culpa qui alias omnis consectetur sed ea minima et eligendi ipsa quia quia voluptas tenetur consequatur itaque quis quo ullam nesciunt error qui sed repudiandae nisi qui cumque accusantium vel omnis quae voluptatum quia ad assumenda nostrum hic rerum et voluptatem odio a minima ipsum quod voluptatem molestiae quod et non tempore et est consequuntur consectetur ad sit laborum vitae molestias natus dolorem recusandae sint quas fugiat excepturi quasi quos laudantium id delectus quidem maiores assumenda et aut quia impedit dignissimos aut eveniet est quas ea voluptates repellendus aut illum quod animi quis voluptatum quia omnis et et eum eaque officiis rem excepturi fugit a quam provident architecto illum ad possimus facere aut voluptatem magni optio earum ex voluptatem quis odio autem quos expedita occaecati libero aut voluptatum optio consequuntur in assumenda omnis eveniet ad consequuntur pariatur beatae doloribus pariatur ipsam nulla dignissimos qui deserunt rerum ipsam asperiores et perspiciatis et corrupti molestias est voluptatem impedit inventore numquam unde et soluta aspernatur et hic ab praesentium voluptas consequatur quasi repudiandae recusandae perferendis aperiam omnis autem quidem omnis delectus aliquid deleniti voluptas dolor ipsum in aut porro illum est.', '0', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('219', '7', 'Omnis deleniti fugit qui ducimus quidem corrupti adipisci.', 'Vel perferendis tempore dolores eaque autem labore vel natus velit fugit eveniet fugiat in qui ipsum et velit magni velit quaerat natus praesentium sapiente deserunt soluta necessitatibus autem voluptatum aspernatur nam veritatis necessitatibus non temporibus iusto earum ut repudiandae alias numquam harum id rerum veritatis occaecati corrupti provident non assumenda in et molestiae et consequatur velit tempore officiis quasi nisi quis et qui impedit vitae amet asperiores blanditiis voluptas possimus dolorum maiores voluptatum qui fugiat nesciunt consequatur omnis aut fuga quos aut nostrum voluptates rerum ea omnis cupiditate nam consequatur vel quo autem qui rerum maiores optio expedita nesciunt sit eius unde commodi cumque sed et omnis nam dignissimos velit non eligendi et minima perferendis at labore incidunt sunt dolore et magni natus vel sit eum possimus alias reiciendis deserunt perferendis expedita voluptatem aut laborum assumenda ab minus vero harum voluptatem eum natus consequatur at dolorum sed tempora ducimus aut dignissimos at optio cupiditate ea rerum minima molestiae qui et necessitatibus non nulla sit facere maiores occaecati ut eligendi mollitia perferendis omnis quis officiis hic sint aut voluptatum beatae debitis nemo reiciendis fugiat debitis provident rerum maxime ut nesciunt tempore neque consequatur qui et et iusto quae sunt magni ex ipsum illum velit dolores perspiciatis repellendus id sapiente dolores totam ut rem quisquam delectus quam mollitia pariatur et quia neque dolores eaque hic ratione quia et autem culpa ea odit error natus est voluptas ut doloremque esse est perferendis laudantium deserunt qui dolor officiis ex velit quia suscipit illum ad dicta repellendus est ipsa dolorem corporis quasi repudiandae quia vero facilis sed.', '0', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('220', '10', 'Ducimus sunt sit ipsum et enim quidem.', 'Esse iste qui distinctio deserunt maiores quibusdam aut non placeat tenetur consequatur sint quibusdam molestiae maiores tempore voluptatem reiciendis quia quia dolorem et dolores repudiandae dolorem quam repellat et id explicabo ab rem ad eveniet dolorem sapiente tempore deleniti hic modi nostrum assumenda deserunt sunt possimus fugit assumenda expedita eum quis molestias exercitationem consequuntur maiores sed ut est asperiores accusamus et tempora vel voluptatem aliquam fuga dolorem eligendi et consequatur voluptate quas qui neque dolorem quia delectus inventore nam illum a molestiae quis occaecati perferendis assumenda maiores sed omnis nulla magnam tempora itaque esse quia beatae quia asperiores ipsa ex sed ducimus ipsam modi nisi voluptas recusandae magnam accusamus et voluptatum consequatur eos accusamus perspiciatis eius sint aut nam voluptas natus pariatur deserunt molestias et distinctio quisquam harum et tenetur sed aperiam sint ea ad vel repellat laborum magni esse qui ut odio velit expedita non et ut est ipsam aut nihil cum aut quis natus vel porro deleniti omnis dolorum sed quia delectus qui ut consectetur et nostrum nihil enim quidem repudiandae debitis distinctio dolores natus nesciunt vero deleniti ea adipisci modi veritatis maiores voluptatem omnis dolore est est omnis laudantium incidunt quo odio beatae ut saepe numquam quasi laboriosam nesciunt deserunt eum eos excepturi atque harum maxime voluptate ratione eos maxime voluptatem omnis minus laborum beatae aut voluptates enim beatae consequuntur dolores est qui quod nisi pariatur.', '1', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('221', '2', 'Qui blanditiis aut voluptatem placeat omnis.', 'Minus eaque recusandae cumque fuga velit perferendis aut et et ut aut dolor nisi odit rem quisquam quia cumque dolores molestiae sit non voluptatem sed aut qui in et libero voluptatibus vel odio architecto iure dolorem consequatur saepe qui excepturi et aperiam repellendus porro ut aliquid tempora minus dignissimos sint necessitatibus molestias qui praesentium sed ipsam accusamus totam nihil voluptatem assumenda et blanditiis et aperiam sint sunt ut enim non sit reprehenderit sint soluta doloribus aut dolores consequuntur ipsum est aspernatur illo aliquam quia totam neque inventore nemo ut deleniti dolor alias nihil nihil et quis ab consequatur sit voluptates sit voluptatem occaecati excepturi non aliquam vel dicta sequi eaque eum velit voluptatem illum non eos id sint cupiditate et maxime dicta magni dolores esse enim explicabo vel maiores eligendi praesentium sit ad libero expedita nobis est doloribus quasi optio aut et qui similique doloremque eos et ut suscipit et illum ut sit quos perferendis id deserunt ut recusandae eaque iste at in molestiae architecto rerum odio blanditiis modi minima blanditiis labore et suscipit ad sed beatae et ut ullam soluta dolorem omnis dolore natus eius ducimus quibusdam qui ea voluptas voluptatibus fugiat vel amet est consequatur sunt id dolorum facilis ipsam et non nisi commodi aut doloremque non amet eligendi expedita quia incidunt voluptas vel a qui voluptas nostrum assumenda porro occaecati quis aliquid eos quo magni eos nihil et occaecati quis sit perferendis veritatis dolorem sunt consequatur amet aperiam pariatur odit quis est dolorem commodi neque veniam dolor omnis vero qui et alias non impedit dolores aut laudantium consequatur nisi quis qui autem iure consequuntur labore magni impedit ab ut ut quia praesentium deserunt enim inventore et quidem.', '1', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('222', '5', 'Officia delectus animi sed quia qui.', 'Ut adipisci perferendis ut totam repudiandae earum ut omnis numquam doloremque sint molestias vel qui quidem rerum velit et nihil vel quibusdam quisquam ut tempore officia et et dolore ex cum tempore dolorem sint quia et suscipit nesciunt officiis vitae quidem maiores eaque autem ea iusto optio magni dolorum sed dolorum voluptas voluptatem quod dignissimos eum et ex et ut neque vel provident qui officia qui eaque et voluptatem totam error repellendus aliquam blanditiis quidem a aut asperiores maiores nihil laborum quaerat numquam dolorem maiores totam reiciendis et eaque quo error dolorem sunt quisquam distinctio molestias repellat a nisi explicabo esse deleniti autem nostrum modi molestias quo ut dolor rerum voluptatem aut molestias modi unde voluptatem temporibus repellat voluptatem a omnis impedit sapiente enim alias architecto dolor commodi velit provident illo ut pariatur dignissimos odio quas nulla dolore explicabo vitae voluptatem eos perferendis recusandae a consequatur officiis quis rerum minus et temporibus incidunt qui omnis autem omnis iusto nesciunt cum quaerat et a qui saepe ut qui aut ipsa unde esse architecto et adipisci qui dolorum corrupti aut architecto explicabo impedit autem dignissimos eligendi quia alias alias aliquid repellat sed accusamus minima et ut reiciendis a beatae est eum ut occaecati perferendis sunt ut accusantium et hic rem consequatur quidem aut labore nesciunt quibusdam recusandae iure voluptatem occaecati accusamus ullam voluptatem eum commodi quos suscipit aspernatur enim veniam aut sunt totam quae necessitatibus suscipit qui quidem laboriosam est aut cumque dignissimos explicabo praesentium corrupti odit reiciendis tenetur soluta odio aut sed at architecto.', '0', '2017-05-02 22:58:56', '2017-05-02 22:58:56');
INSERT INTO `course_news` VALUES ('223', '8', 'Veniam odio omnis iusto quia consectetur cumque labore.', 'Velit qui quo voluptate corrupti nisi iusto aut qui vero temporibus voluptatem recusandae ab sit minus vitae eaque ratione quibusdam sed cum rerum debitis non dolore autem blanditiis quo voluptas qui sunt voluptas iusto voluptatem tenetur magnam id mollitia iste qui tempora aut deserunt neque magni alias veniam molestiae aut qui veritatis veniam quam dolorum iste autem ea eius ut aut qui ex rerum quibusdam quia voluptatem itaque sed adipisci ea rerum eos commodi voluptatibus omnis laboriosam architecto soluta et consequatur ut assumenda facilis voluptas ad soluta placeat provident dolorem at fuga rem eaque ut nihil et qui praesentium iure aspernatur officiis dicta quis quod occaecati aut optio at amet ullam et nisi nisi aut accusamus quas vel at libero id nesciunt non amet omnis vero id itaque voluptas et sit eius fugiat facilis nisi culpa rerum consequuntur voluptatem velit quia nemo adipisci odit ratione aut voluptatum sit voluptatem aperiam quia sed aperiam qui quod distinctio cum explicabo similique incidunt ipsum voluptate non quidem quaerat omnis maxime esse id et delectus rerum ullam reiciendis aut voluptates quae et iure non illo commodi ex et labore quos ratione suscipit suscipit error libero sunt delectus consectetur accusantium vel optio iusto consectetur iure qui asperiores.', '1', '2017-05-02 22:58:57', '2017-05-02 22:58:57');
INSERT INTO `course_news` VALUES ('224', '5', 'Sed earum reiciendis aut voluptas eos.', 'Modi vero quod magni animi sint omnis molestiae minima ullam molestiae sit ex consectetur eos voluptatum sit aut ut ex voluptatibus recusandae ducimus reprehenderit cupiditate dolores ut omnis ab enim commodi qui dolores nisi cupiditate est excepturi est neque officiis eum ut corrupti similique quod qui cumque harum numquam sed corporis repellendus enim unde aliquam aut aut expedita nulla beatae voluptas eaque quo temporibus et in qui iusto maiores nobis omnis sed aut totam aut veniam omnis odio distinctio neque et animi labore enim laboriosam alias corrupti repellat est beatae sed laudantium fuga sint laboriosam iure magnam et nam impedit consequatur eveniet et ex quod provident laborum temporibus odio saepe doloribus omnis fugiat est ut totam expedita inventore quidem illum voluptatem dolore placeat repudiandae odit quis eaque quia est non est alias voluptatem dolore aut nihil est ut autem ea libero dolores similique delectus et saepe adipisci fugit reprehenderit minima dolorem iste quasi ullam distinctio voluptas inventore asperiores est rerum officia dolor maiores provident nemo perspiciatis sint dignissimos aliquam nesciunt dolor tenetur sunt neque maiores aperiam mollitia ab soluta sunt officiis esse aut quia maiores temporibus illum quasi doloribus nesciunt mollitia culpa voluptas optio animi ab fugit cum dolores vitae esse quam pariatur omnis aut est non impedit quia quaerat voluptates sed minus eligendi.', '0', '2017-05-02 22:58:57', '2017-05-02 22:58:57');
INSERT INTO `course_news` VALUES ('225', '9', 'Facere aliquam earum velit quisquam eveniet.', 'Perspiciatis molestiae omnis ipsam aperiam exercitationem tenetur distinctio est at harum magnam et eum optio reprehenderit qui consectetur architecto iure aut qui illum quia iure quas inventore pariatur adipisci odio perferendis nostrum dolorem sed in voluptatem quis aut laudantium repudiandae excepturi iure reprehenderit deserunt sed eligendi alias autem rerum dignissimos a incidunt eum et dolor aperiam non numquam cumque tenetur rerum dolores ab voluptatem praesentium ut voluptas ut sed omnis sint omnis id rerum et qui qui eos quibusdam cum unde ducimus quos quia dolor officiis ut quis ab est aut dolorum doloribus tempora et mollitia tenetur voluptas minus earum dolorum odio blanditiis recusandae eum laboriosam et aut expedita accusantium facere quo doloremque ut minus minus assumenda est laboriosam ipsam atque eligendi dolores aperiam placeat architecto laboriosam aut autem aut ea molestiae non quia facere aut ad quo voluptatibus laudantium alias sunt enim id consequuntur alias et consequatur ipsam unde pariatur modi rerum repellat ipsum natus dolor in optio reiciendis quia in velit itaque quo in est dolor perferendis magni provident repellendus corrupti totam qui optio cupiditate libero rerum saepe perspiciatis ad sed dolores aut maiores quod voluptatem nulla dolores qui non dolorem vel ducimus impedit fugiat nisi tempore exercitationem qui consequatur alias minima molestiae repellendus aut nihil dignissimos ab autem totam illo iusto nulla sit deleniti dolor iure omnis aut et est alias dolorem dolore dolorem ducimus laborum aspernatur harum eos harum est non at odit velit laborum ut et cumque non tenetur minus consequatur omnis eaque quam eum dolor facilis et sed dolorum nisi doloribus voluptates vel ut impedit omnis aut illo iure qui non sed aliquam debitis repudiandae animi aperiam numquam porro quam nulla assumenda vel natus et asperiores inventore sunt assumenda q