INSERT INTO `course_news` VALUES ('226', '7', 'Accusantium explicabo inventore omnis tempora dicta est quis odit.', 'Ad quae quibusdam dolorem veniam rerum quaerat saepe voluptatem nam omnis veniam et reiciendis rerum nisi veritatis autem aliquid velit enim magnam non tempore hic et nihil eligendi dolores qui ipsam labore iste sit aut nulla quas minima sit eaque iure cum aut vitae repellat nam optio magni in quod et ad quisquam exercitationem optio consequatur quo molestias aliquid et modi nisi voluptatibus delectus non et sed omnis aut aut harum alias dignissimos fuga eum inventore quia quis culpa corrupti laboriosam eum alias vero sint ut qui quidem totam unde aut et necessitatibus distinctio eius incidunt et suscipit velit ut minus quas voluptate alias necessitatibus maiores eos animi dolores voluptatem ut voluptatibus ut similique consequuntur aliquam occaecati et consequatur aperiam sequi qui doloribus suscipit et molestiae consequatur quod ut asperiores autem accusantium repellendus assumenda culpa quidem quam sit aut atque repellat ducimus facilis et placeat exercitationem qui quia aspernatur explicabo provident veritatis commodi et quod in incidunt nisi est explicabo eum aspernatur excepturi perspiciatis quo veritatis rem unde eum voluptas voluptatem aut cupiditate quia veniam perspiciatis veniam eum repellat suscipit hic error eius aut fugit excepturi eos molestias quidem expedita veniam velit qui ratione molestiae non fuga libero aut error sit eos sunt doloremque eius qui velit illum praesentium corrupti omnis quaerat dicta minima ea sint necessitatibus odio nobis est dolores sequi velit sit ut aperiam aliquam explicabo laudantium similique et ut vel suscipit commodi non aut vel ducimus numquam repellendus fugiat animi blanditiis labore sed aut nemo qui ducimus ut sequi aliquam culpa itaque vel et esse aut voluptas ipsa atque officiis omnis praesentium voluptas et est ut voluptatem id dolore in repellat sunt amet corporis dignissimos autem consequatur laud