INSERT INTO `course_news` VALUES ('227', '4', 'Harum est ea odit occaecati quo voluptatum et.', 'Quia iure quod repellendus voluptatem ducimus nulla voluptas aut tenetur magni odio esse quae similique asperiores id nobis ullam occaecati aut quos ea officiis incidunt necessitatibus expedita animi error id voluptatem possimus eveniet perferendis maiores est eos totam amet necessitatibus molestiae ut similique a cumque molestias accusantium aspernatur quisquam at asperiores quis sint magnam consequatur quia quo et facilis quia voluptatem quos et asperiores accusantium non inventore impedit rerum voluptatem molestiae sapiente ut quisquam soluta porro ea et deleniti et consequatur consequuntur corporis est neque sint inventore rerum ipsam ratione at veritatis itaque quidem incidunt quaerat dolores molestiae nihil cum eius voluptatibus numquam odio quia molestiae et recusandae facilis error veniam porro minima beatae dicta ratione animi qui voluptatem fugit quaerat nam pariatur aspernatur voluptatem quia inventore est eaque possimus sit necessitatibus consectetur omnis quas ea incidunt occaecati incidunt cumque tempora repellendus iusto deleniti incidunt maxime dolorum nostrum ullam aut sit dolorem voluptatem est id iure qui ipsam iure fugit consequatur et odio iusto laboriosam iure ut eum molestias consectetur mollitia est nihil modi quia rerum est omnis aut eos eaque amet et libero voluptas ducimus ut cum minima ipsa dolorum suscipit harum fuga sed deleniti ut consectetur non ut sit eum quasi quidem consectetur ducimus aperiam dignissimos placeat eaque autem veritatis ut quia omnis atque quisquam tempore officiis et itaque esse voluptatum consequuntur sequi architecto porro tempora non non veritatis voluptas quae et in consequatur quibusdam qui eos facere molestiae enim quis molestiae similique nisi voluptatem hic voluptas facilis ut ipsam id et iste expedita et dolor esse iste in rem eius vel sapiente aliquam neque neque est adipisci fugit totam ratione velit qui quia quos impedit magnam quod dolor cum est quia a nam totam ut omnis officiis maiores et atque temporibus dolor ipsa repellendus qui magni voluptatem ut aut modi sed iure unde perferendis ut iste ipsa odio reiciendis itaque voluptas quo incidunt ex excepturi aut aut et sed illum rerum harum nesciunt eos animi amet et et molestiae illum et sit in nulla earum ipsum ab explicabo consectetur harum assumenda nulla repudiandae dignissimos sit amet minima error aut labore id quibusdam sint non deserunt corporis doloribus vel quam voluptas ducimus omnis itaque ratione saepe molestias cum reiciendis sit architecto recusandae dolores omnis consequatur quod occaecati quibusdam distinctio error error et illo odit quidem quia facilis harum cumque error totam aut ratione provident id nam doloribus praesentium tempore laboriosam qui sit consequatur saepe quidem minus quam sed est at nesciunt a consequatur.', '1', '2017-05-02 22:58:57', '2017-05-02 22:58:57');
INSERT INTO `course_news` VALUES ('228', '8', 'At explicabo dicta voluptatem dolorum neque a.', 'Eos ut unde explicabo repudiandae maiores sapiente quae molestiae et est et consequatur maxime quae corporis quaerat qui consequuntur vitae et at officia quidem consequatur veritatis doloremque ea earum cumque eaque sit beatae nostrum fuga aut voluptatem sed fuga minus quos eum quam ut sed vel qui voluptatem est fugiat voluptatum consequatur dolor omnis dolorem corporis hic aliquid iste facere sunt vel quasi saepe pariatur quam voluptates neque non nobis recusandae fugiat amet temporibus rerum at ex magnam consequatur ut qui eveniet itaque quia dicta ea sed perspiciatis quisquam voluptas sed voluptatem velit incidunt perferendis dolorem voluptate laboriosam fugit ullam voluptatem distinctio quis nemo consequatur exercitationem similique nam sequi quia eum accusantium ut voluptate non minus est molestiae molestiae libero possimus facere consequatur voluptas quasi fugit odit quia excepturi eligendi rerum consequuntur provident ratione provident nulla iste dolorem ducimus et quia laborum nam optio error cum et illum corrupti dicta maxime fuga recusandae debitis impedit in sunt accusamus quaerat asperiores cum cum est aut rerum nemo reiciendis repellat autem quam et sed neque nihil quia molestiae sunt earum adipisci inventore sunt expedita quam quae eum laborum et dolorem ratione iste ipsum et architecto id dolores aut non alias consequuntur molestiae alias quo est ducimus reiciendis aliquam sapiente qui blanditiis magnam et eos et voluptatem autem iure magnam debitis omnis fuga iure harum quidem eligendi ea et qui possimus voluptatem rerum voluptatem quam repudiandae pariatur sint id harum voluptate quidem ut et eligendi exercitationem vel nisi illo et quos voluptatem rem omnis veritatis ipsam sit dicta assumenda molestiae possimus consequuntur itaque eum cumque est consequatur distinctio ipsum non voluptas recusandae et odit sapiente maxime mollitia sed quis voluptas provi