INSERT INTO `course_news` VALUES ('229', '3', 'Voluptatum officiis dolorum ut nostrum dignissimos.', 'Tenetur impedit quia ut quasi laudantium facere animi dolorem autem dolores sunt illo corrupti quo dicta tenetur quos molestiae eos et repudiandae rerum optio explicabo excepturi ducimus consequatur tenetur et voluptas voluptas aliquid quo hic ipsam non iusto provident quisquam id reiciendis molestias iusto nihil possimus rerum est nihil cum debitis quia reprehenderit voluptatem ad est numquam quis molestiae sint velit officia sit totam sed a earum dolor aut quis et et esse unde fugiat vitae consequatur asperiores quia dolores qui velit quo nostrum eos distinctio distinctio ab modi nobis autem reiciendis mollitia veniam aut cupiditate ut qui tempora ut earum quia nemo non eius qui numquam temporibus fuga delectus dolorem libero quasi quisquam quod et animi et qui sunt perferendis voluptas fuga ut sapiente repudiandae aperiam ut magnam ea qui facere a totam inventore quis est error optio dolor sit omnis omnis eligendi provident ipsa consequatur eius quaerat voluptas ex provident neque voluptatum distinctio doloribus debitis et velit illo est odio est veniam voluptatibus natus provident dolorem rem possimus et provident expedita minus nisi exercitationem autem amet quia ea labore atque dolores et officia accusamus ut accusantium ab facilis corrupti deserunt est ut excepturi in deserunt tenetur est debitis quia officiis cupiditate qui illum eos corrupti dolorem nobis dolorem eos quas non ex libero qui odio cumque rem repellendus natus officiis atque id cumque ducimus dolor omnis mollitia blanditiis incidunt provident vero error neque atque ab velit veniam nobis et sint est ex natus veniam ut sint quibusdam quia rem et et perferendis officiis ut blanditiis velit repellat voluptatibus autem repellat quas iusto debitis dolores maiores ratione id voluptatem sequi ut voluptates incidunt quo modi sequi consequatur quod aperiam culpa culpa ullam corrupti odio nostrum enim distinctio doloremque ipsam corrupti a ipsa explicabo et at blanditiis qui quibusdam sunt iste est et ex autem magni libero dolorem ullam quis libero dolorem rerum laboriosam aliquam magnam laudantium qui nobis vel eligendi fugit omnis est aut est est ad molestiae repudiandae possimus.', '0', '2017-05-02 22:58:57', '2017-05-02 22:58:57');
INSERT INTO `course_news` VALUES ('230', '1', 'Saepe atque nihil sequi necessitatibus vel tempora voluptatem.', 'Dolores libero repellendus doloremque tenetur et molestias atque suscipit commodi possimus assumenda omnis dolores fugiat eum rerum distinctio culpa ut dolor dolorem placeat qui aspernatur eaque quidem non sint eius eum ut at debitis deserunt veniam quo impedit distinctio et qui error vitae quia vel optio necessitatibus eos quia eos quo earum consequatur repudiandae corporis adipisci doloremque suscipit eos veniam sunt necessitatibus et id consequatur sit voluptatem consequatur voluptatem exercitationem sit ea aut voluptatem possimus non perferendis similique est laborum laboriosam quas reprehenderit est dolores quis explicabo voluptatem dolore reiciendis cum exercitationem nihil sunt fugiat ipsam quis recusandae cupiditate ut quo qui qui fugiat et reprehenderit voluptatem voluptas quis et error quisquam natus et sint minima sit quia exercitationem explicabo nihil perspiciatis ut est fugit recusandae qui optio enim illo corrupti nobis aspernatur et et tempora eos aut doloremque quam iste et est sed quaerat quas corporis nesciunt necessitatibus ut dolores numquam velit ipsum omnis facere voluptatem sit fuga explicabo omnis laborum eum aut saepe corrupti nam consequatur sit officia ducimus vero voluptate labore voluptatum alias aspernatur cum cum provident dolore doloribus omnis deserunt consequatur placeat impedit illum esse impedit consectetur quo consequuntur velit sint rem nihil vel dolorem optio molestiae dolores aliquid qui qui.', '0', '2017-05-02 22:58:57', '2017-05-02 22:58:57');
INSERT INTO `course_news` VALUES ('231', '4', 'Et quod quidem quos.', 'Ratione eum excepturi et vel distinctio atque quis officiis sunt aut velit pariatur nostrum aspernatur voluptates ad tenetur reiciendis ut quasi deserunt aperiam quia officia fuga repellendus mollitia dolor veritatis ut est sint alias quis ut animi id quasi et soluta quisquam consectetur dolores ad eos provident et dicta assumenda voluptatibus autem dolorem eveniet dolores deserunt autem harum cumque rerum amet nemo nesciunt nisi quisquam nulla maiores quia blanditiis ea explicabo saepe dolorem ipsum sed facilis harum quo quia sint atque voluptatem ut qui aut tenetur voluptatem est architecto similique architecto cum quidem dolores officiis quam et autem et et et enim error iure non aut minus autem architecto a ipsam est harum similique sit numquam quam suscipit et voluptatem corrupti alias dolorum itaque dolor eius deserunt voluptatem reiciendis numquam et in dolorum molestiae debitis sed ducimus quas excepturi voluptas delectus ducimus quas delectus odio et repudiandae minus minus laborum magnam accusantium amet et cupiditate autem quam mollitia velit et aut totam odio excepturi eligendi atque eos explicabo porro dolores dicta repellat consequatur quia aliquid sed earum et aut animi harum consectetur labore id quisquam quaerat quo consequatur est consequatur voluptas eum labore ducimus eius voluptas omnis cumque vero in in ipsum deserunt vitae ex atque corporis asperiores sit molestiae numquam exercitationem rerum voluptas veniam qui distinctio dolorum sit sunt aspernatur soluta voluptates itaque beatae est quos provident vero magnam voluptatem alias perferendis ratione itaque possimus dignissimos magni et rerum beatae aliquid vel quidem dolorum maxime voluptatem sed aliquam impedit aspernatur et vitae vel repellendus rem vel reprehenderit nesciunt dolorem qui nesciunt modi eligendi molestiae modi quis rerum inventore magni adipisci ex ut esse similique temporibus molestiae in eius velit pariat