INSERT INTO `course_news` VALUES ('232', '8', 'Ut et porro magnam adipisci.', 'Minus et eaque tempore non adipisci illum omnis sint consequatur numquam placeat et ut facere accusantium mollitia nemo totam beatae et quia quia nobis veritatis facilis animi reprehenderit omnis dolor dolor est laborum quam ad sunt id quod rem optio mollitia aut rem quibusdam aut aut ad molestias eligendi rem voluptatem est et debitis minus aliquam aut iusto voluptatem ut saepe est repellendus accusantium excepturi repudiandae tempora odit quos recusandae commodi sunt non totam laudantium tempora modi ipsa rerum et quo consequuntur ipsam ipsum qui cumque minima ut ut eligendi enim dolorem vero ipsum laboriosam accusamus a molestiae vel id qui dolor in non et labore omnis aut dolorum ipsum qui assumenda sit quos eum aspernatur quia sint aut officia et enim in odit nihil omnis dolorem dolor praesentium distinctio possimus qui temporibus aut ut quod ea iusto ut porro voluptatem numquam similique ratione nobis deserunt velit nostrum assumenda reprehenderit incidunt inventore quasi commodi error incidunt repellat aut vero dolores id neque quis minima dicta similique necessitatibus explicabo non excepturi nulla quasi et minus expedita consequatur repudiandae quia est est et quis omnis natus perferendis sed sint possimus vero qui inventore excepturi tempora eveniet architecto deserunt illo eum illo excepturi architecto totam reprehenderit tempora eaque nulla error cum rerum sequi voluptatem qui ipsam optio repellat minus pariatur sed ipsum dignissimos asperiores rerum perferendis assumenda quam sunt non quas quaerat voluptates quos facere mollitia excepturi ut velit ea eos voluptas et veritatis possimus quas nihil recusandae quos qui animi sint et ipsam eos aperiam et sunt sint laborum minima ea debitis consequatur doloribus ea laborum et beatae vero voluptatum iure nisi et sit cupiditate et sapiente culpa eum assumenda at dolorem est quasi non sunt qui corrupti voluptate voluptas suscipit praesentium voluptas sit quae quaerat possimus dolorum autem sapiente nulla magnam consequatur autem animi minus in modi laborum pariatur doloribus eos labore voluptatibus et omnis consequuntur soluta iste est odio quos corrupti omnis perferendis blanditiis magnam id suscipit quas eum unde omnis iste officia rerum et nihil ratione odio libero qui ut perspiciatis esse aspernatur eaque itaque et error ducimus laborum omnis illo amet quas debitis eum sequi ad iure dolorum est quae officia magni iusto ex est deserunt et aliquam nulla quos tempora quia veniam assumenda excepturi aut libero quo inventore possimus ipsam vitae aliquam at fuga totam qui deleniti perspiciatis repudiandae totam quae qui non ipsam ut et illo.', '0', '2017-05-02 22:58:57', '2017-05-02 22:58:57');
INSERT INTO `course_news` VALUES ('233', '4', 'Aspernatur ut adipisci exercitationem.', 'Ut vero voluptatem soluta omnis et voluptas dolor est nihil dolorem molestias voluptatibus est alias nobis praesentium voluptatem amet omnis possimus voluptas ut quisquam laboriosam accusamus sunt possimus vero et voluptatem quasi qui explicabo architecto cum molestias explicabo illo quo adipisci cum repellendus molestias et est nulla dolorem magnam animi dicta repellat quia voluptatem blanditiis dolorem odit dolore aut eius consequatur nemo quo qui rerum at corporis adipisci esse ratione modi distinctio doloremque hic voluptatum aut et doloribus accusamus rerum ad et qui fuga repellendus deleniti magni nesciunt sunt et animi quia nobis natus facilis dolorum sed non reprehenderit unde eos suscipit nam et non qui doloremque quis voluptatem qui dolores iure dolores voluptas id molestias beatae omnis quaerat temporibus atque officiis ipsa consectetur ab minima molestiae iure quaerat non et quia laudantium iste dolore aut exercitationem repellendus mollitia debitis aut modi odio quis quaerat dolor minima ab earum officia dolorem magnam velit ut ducimus earum voluptate optio corporis praesentium excepturi aut vero minima qui quaerat id doloribus reprehenderit ratione aut nihil porro amet fugiat optio voluptatem velit perferendis saepe ea et quos reiciendis pariatur laborum reprehenderit placeat porro in aperiam quia repellendus non dolorem nihil odit perferendis assumenda perferendis at sit omnis hic asperiores distinctio quod harum maiores dolores voluptas repellat voluptatibus fuga adipisci sunt omnis necessitatibus ea odit et architecto doloribus itaque distinctio deserunt id tempora odio unde veritatis eos et ducimus sint omnis esse quo quis excepturi blanditiis et nihil velit quia molestiae dolor quaerat eum delectus suscipit suscipit aut iste praesentium nulla vero eius est nobis dolorem itaque itaque error veritatis delectus eius est perspiciatis non eveniet quia incidunt ab d