INSERT INTO `course_news` VALUES ('234', '3', 'Veniam et a voluptatem magni consequatur repellat nihil.', 'Quae deleniti quod aut iste minima laudantium rerum hic dolorem quia praesentium doloribus magnam aut rerum voluptatem est facilis optio minus aut esse maxime voluptate asperiores reprehenderit incidunt quidem quibusdam amet omnis et at voluptatem vel libero dolorem modi eveniet aliquam quibusdam placeat deserunt voluptas ut unde minima cupiditate aut eum minus esse labore quia quia quam voluptatibus qui id dolores mollitia quia laudantium totam ipsum qui quod itaque distinctio architecto quia est quaerat nihil sit rerum fugiat asperiores aspernatur sapiente minima iusto quia et qui natus deleniti atque corporis beatae et at maxime molestiae natus earum eveniet magnam sed hic ut sunt officiis dolores voluptatem distinctio beatae modi est nesciunt quisquam ipsam sequi velit labore qui in reprehenderit repellendus numquam exercitationem voluptas et harum ducimus repellat et vel sapiente sint rem eveniet debitis sed ipsum aut reiciendis ratione molestiae est praesentium qui et quo porro et animi ut placeat consequatur repellat ea itaque ipsa reiciendis sed nulla nihil ut ducimus sunt autem ut ipsum labore sint repellendus numquam rem quia reiciendis numquam ipsa cupiditate voluptatem ratione perferendis sit enim ut odio eligendi ea et et ut eveniet laudantium provident veritatis officiis qui impedit neque placeat libero dolores fugit ab similique cum officia et architecto et quod dolores ea voluptatem cupiditate quia autem voluptatem alias ullam qui vel tempore voluptatem est saepe error blanditiis rerum quia nemo in ipsum neque corrupti omnis nostrum cum voluptatibus perferendis id eveniet voluptate occaecati et repudiandae tempore explicabo sunt fugiat aliquid sint aut et inventore laudantium aut praesentium aut molestiae qui quos dolore unde quis voluptatem provident fugit excepturi rerum explicabo eveniet voluptatum mollitia possimus sequi ratione odio quam il