INSERT INTO `course_news` VALUES ('235', '7', 'Atque fuga enim molestiae non quo.', 'Iste ipsum tempora magni consequuntur cum quisquam quo ut quisquam distinctio repudiandae accusantium non aut corporis sunt ut porro eveniet aut dolor temporibus ex voluptatibus rerum impedit sit non et tempora quia minima et sunt expedita quaerat praesentium voluptas ut in fuga nihil non et quia voluptatum quas cum eius iure dolore et sit harum animi odio aut et cupiditate libero voluptatibus id natus magni perferendis distinctio dignissimos est ratione earum voluptas dolor nobis voluptate qui nobis qui cupiditate et corporis sequi sed vel qui officiis soluta voluptatem voluptas iusto magnam atque incidunt porro dolorem sint qui ratione et aut aliquid eos qui quia nulla eos est vel dolore ipsum quo pariatur esse aliquid quia optio maiores assumenda voluptate architecto mollitia cum repellendus omnis ut quidem perspiciatis ut qui pariatur consectetur repellendus quos molestiae accusantium architecto placeat dolorum repellendus et amet aut est maiores nemo porro eius eos soluta iste explicabo vitae amet accusantium voluptates explicabo ex at omnis laborum sapiente maiores id consequatur quod cum temporibus facilis ipsum et aperiam dolor illo et qui eaque eos beatae magnam asperiores eum libero culpa quia fuga quam consequatur consequatur temporibus eum alias voluptatibus quasi sint eaque sunt repellendus temporibus odio saepe aut quia omnis magni omnis doloremque ipsum fuga rerum eos pariatur dolor natus aliquam iure inventore porro quo qui quasi in et amet est quod sit dolor commodi saepe accusantium laboriosam accusamus deserunt ratione doloribus rem quo et culpa veritatis dolorem enim fugiat dolore rerum quos adipisci eos ut quisquam dolores in aut dolor eos quas sed ut minus numquam et laborum et voluptatem rerum et fugiat neque cumque quibusdam tenetur officiis nisi rem rerum totam rem fuga consequuntur repudiandae nulla explicabo accusamus tempora quas ut et sed placeat corrupt