INSERT INTO `course_news` VALUES ('236', '9', 'Nam quas et eum.', 'Tenetur est et quia ad molestias dicta qui dolores animi aut consequatur repellat consequatur nostrum non est deserunt et voluptatum ex voluptate eligendi hic repellendus nulla magnam distinctio eligendi tenetur commodi a velit inventore molestias aut non eos quam officia deserunt qui voluptatum nisi consequatur totam non ab quos vitae voluptatem quia voluptates voluptatem quia alias amet quibusdam ullam necessitatibus tempora nostrum cum eum consequatur nihil expedita sed repudiandae voluptates earum quaerat temporibus neque aut similique maiores cupiditate ut nisi sapiente rerum reiciendis sunt sit alias facilis culpa ea maiores voluptatem qui totam expedita et minima incidunt dolores ea et reiciendis omnis qui occaecati expedita quod tenetur repellendus aliquid quidem totam quam doloremque quis dolorem libero optio molestiae hic nihil non nam ratione provident perferendis magni quasi expedita quis omnis voluptate qui dignissimos est expedita commodi nihil nam dolore velit mollitia reiciendis alias et qui repellat quo sed minus minus est quod voluptas praesentium fugit praesentium itaque dignissimos consectetur est magnam rerum ut architecto minus excepturi quia quisquam exercitationem debitis aut odio officia placeat modi voluptatem vero quibusdam totam inventore dolor sit beatae est molestias labore vel ea magni natus et esse ut accusantium ab doloribus nihil commodi ut aliquam suscipit dolores laudantium officiis eos eius dignissimos incidunt et exercitationem deleniti iste occaecati enim omnis animi est quidem error et veniam blanditiis quae minima numquam iusto sint voluptatum cupiditate distinctio enim occaecati quis autem non praesentium deleniti hic ut quo id quia aut velit ut totam nam officiis aspernatur quisquam quis quibusdam vel eos magni fugiat sit accusamus ex commodi veritatis voluptatibus quasi quibusdam saepe aliquam quo aspernatur tenetur at unde assumenda molestias est dignissim