INSERT INTO `course_news` VALUES ('237', '9', 'Sit cumque accusamus vel.', 'Voluptates inventore voluptates voluptatem et a temporibus odit aperiam nihil corrupti omnis ipsum in dolores pariatur velit rerum et ut similique dolores ut sit non ab laudantium quaerat fugiat inventore et provident facere voluptatem est architecto numquam adipisci aut reiciendis sed animi sunt amet qui explicabo sunt voluptatem voluptas quisquam laudantium magni iure sint molestiae corrupti est quod ex a nemo mollitia ut et vitae error repudiandae non repellendus impedit quos qui et reprehenderit unde quae aut tenetur molestiae amet voluptatem labore nisi facere sed omnis dolorem repellat eos eligendi veritatis placeat qui corporis sit quos vel molestiae magni quia sit assumenda ullam dolor architecto modi ab veritatis sit quis non magni qui nostrum blanditiis cum occaecati cupiditate amet facere sit non architecto nobis magni quia sapiente nobis maxime officiis at sed eum cupiditate aspernatur quia quam odio minus quia iusto beatae commodi maxime dolor fuga voluptate sed nam dolorum illum ad ipsam ea delectus ea eos occaecati odit non voluptatem beatae dolorem ea et animi quisquam ducimus error rerum possimus dolor illum amet possimus eum fuga libero exercitationem delectus aut nam est non recusandae laudantium sunt ut nobis corporis est aperiam ut voluptas nobis laboriosam et nam quod non qui qui voluptas aut et adipisci harum quibusdam odio tempora quo dolores sint corporis magni natus quibusdam veniam accusantium rerum illum aspernatur sunt sit nesciunt minima et dolore rerum magnam sed veniam atque sed aut quaerat corporis ipsa numquam voluptatum rem facilis quas accusantium dolorem quae commodi aut voluptatem culpa sequi velit voluptatibus et ea alias velit eaque hic aperiam et molestiae quia necessitatibus ducimus sed quae tenetur laboriosam ipsa quae ducimus rerum qui facere ut autem quo veritatis modi voluptatum fuga sed cupiditate fuga nisi ipsam velit eum dolor explicabo nulla 