INSERT INTO `course_news` VALUES ('238', '2', 'Tenetur et animi deleniti iure ut.', 'Dolore optio aliquid deserunt consectetur aut explicabo omnis et soluta accusamus tenetur earum quia error perspiciatis maiores blanditiis dolores autem quam ipsa natus ullam omnis error odit quos laboriosam sit pariatur quo aut aspernatur non vel soluta unde fugiat ducimus dicta est sed saepe sit in voluptas eum necessitatibus fuga aliquid in voluptatem doloremque ullam autem qui distinctio id quod iure minus et quisquam sequi quaerat voluptatem dolorum distinctio maiores qui ut sint et quia totam id et occaecati at sint sed natus quia sit eveniet magnam sit aut est doloremque delectus corrupti perferendis eum recusandae voluptatem dolorum ratione qui laudantium ipsa consequatur voluptatem voluptatem tenetur exercitationem vero molestiae ducimus aliquam laborum necessitatibus facilis nulla eos maxime soluta optio molestias occaecati repellat non maxime ducimus repudiandae numquam porro quibusdam perspiciatis minima quam minus nihil harum sequi eveniet fuga recusandae fugit officia nobis nisi molestiae error modi voluptatem hic officia sint voluptatem iusto vitae id dolorem quam sed eos labore natus qui sint cum qui culpa adipisci nesciunt quo eum ut voluptas beatae temporibus illum quidem quia omnis voluptas in omnis neque odit sint quis eum soluta tenetur dolores sequi in et non delectus iste esse sunt sit libero perferendis aliquid aut similique quo qui enim qui molestiae blanditiis cum dolorum suscipit corrupti voluptate qui rerum temporibus voluptas iure in beatae mollitia deserunt quisquam enim quia eum eos fugiat aut et id velit quibusdam autem laboriosam vitae aspernatur quo blanditiis ipsam qui quo architecto soluta similique modi harum voluptatem impedit autem velit voluptatem consectetur dicta labore quis exercitationem fugit id sunt doloribus nobis dolores quia aut nesciunt nisi distinctio atque voluptatum molestiae unde recusandae distinctio repudiandae id veritatis distinctio ullam laboriosam voluptatem perferendis molestias id voluptatum eum facere rerum enim et adipisci suscipit dolores ea enim quisquam possimus sequi sequi unde delectus repellendus distinctio laboriosam aut dignissimos repellendus quo similique aspernatur sit exercitationem consequatur consequatur fugiat laboriosam assumenda magni dolor hic ipsam harum doloribus voluptas voluptatem occaecati magnam vel sed consectetur est atque nesciunt sed modi alias fugit iusto enim cum quis et magnam repellendus quos quam sint necessitatibus cupiditate minima repellendus atque impedit mollitia voluptatem nam consequatur ducimus aut ut ullam magnam assumenda voluptatem et consequatur ut neque rerum totam omnis adipisci dicta molestiae in voluptas.', '0', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('239', '3', 'Est necessitatibus nihil dolores ab qui.', 'Beatae veritatis libero labore veniam hic nostrum quia culpa et voluptas dolor voluptatem et atque qui ut iusto quaerat sed quaerat atque dolores sit alias ea unde consequuntur quis ex illum deserunt commodi minima autem ad eaque consequatur accusamus earum totam natus sit amet facilis et nesciunt qui vero fuga quis eos odio rerum velit doloribus quis sit rerum non est aperiam aliquam dolorem sunt fugiat reprehenderit non nisi facilis incidunt et rerum quasi dolore a nihil rerum sunt hic ea amet assumenda et facilis praesentium voluptatem distinctio saepe natus consequatur mollitia architecto et repudiandae tenetur culpa eius est illo necessitatibus unde sint ut magnam et minus unde porro dolores consequuntur quod qui et qui necessitatibus nisi molestiae dolor eveniet ut corporis minima quaerat harum iste ad dolor omnis in labore fuga occaecati repellendus sunt dicta magnam numquam aut tenetur dolor impedit quibusdam eaque eum et numquam consequatur assumenda molestias unde beatae aut facilis libero sit deserunt dolore tenetur quia iste sequi sed autem iste eum saepe quas sint aut non omnis quisquam consequuntur nihil non quibusdam minus perspiciatis dolor tenetur sint ut dolorum vel assumenda maxime minus quia omnis doloremque qui recusandae ullam deleniti nihil consectetur porro vel architecto sunt eos ex perspiciatis deserunt nihil expedita ea et non sit quidem nostrum voluptatibus qui impedit assumenda ut quibusdam neque et quia ut libero nisi aut rem vel qui dolores ut consequatur consequatur quis voluptatem officiis sit voluptatum consequatur ex voluptatum autem possimus iure perferendis veritatis dolore est qui consequatur quae sequi sapiente.', '0', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('240', '4', 'Illum corrupti amet sunt.', 'Consequatur adipisci aut quam repellat molestias nobis laborum nobis amet ut facilis adipisci qui autem sapiente nobis quia ut culpa dolor cupiditate ut voluptatibus ea neque quia culpa ex esse est odit quisquam cum consequatur fugiat error at sequi suscipit velit impedit voluptatem et dolores labore eius sit vel tempora aliquid enim repudiandae est molestiae exercitationem et in fuga et recusandae adipisci quam voluptates illo reprehenderit non quia et dolore et non animi quia id et hic nihil libero architecto necessitatibus molestiae ipsa quia consequuntur ut praesentium ipsum quia vero assumenda dolorum nihil et sit aut eaque magnam voluptas architecto et sint ea rerum cum minima et rem voluptas saepe quia amet aut ducimus est iure quae quis ut ipsum et accusantium reiciendis est eius dolorem aut aut nesciunt aliquid voluptas voluptas nam quae quia vitae eaque debitis et in qui tempore ut molestiae dignissimos quae enim quia nam repellat aut repellat sit perspiciatis dolorum dolor omnis et temporibus natus nulla quasi dolores quia at non sunt dolore earum non quis tenetur accusantium vero nam voluptatem unde soluta ea id rerum dignissimos quae animi sint ullam debitis recusandae ipsum similique dolorum est voluptas molestiae tempore in ratione occaecati maxime fugit voluptas animi adipisci recusandae deleniti magni dignissimos id itaque ratione omnis mollitia est dolorem omnis autem a dolorem dicta est reprehenderit sapiente sint ipsa laudantium qui quibusdam earum qui ullam voluptas expedita corrupti porro eum eaque voluptas in iure nemo sunt voluptatem est cum consequatur quia eius itaque omnis voluptas perferendis dicta nihil eum perferendis consectetur nihil aliquam molestiae tenetur quia sunt expedita optio mollitia laboriosam rerum est est cumque mollitia consequatur nihil accusamus consequatur labore est impedit dolore optio veritatis alias quos adipisci dolorem aut reiciendis ut voluptas sunt qui maxime alias provident inventore repellat dolores a voluptas fugit est dolor eum aut eos harum a consequuntur sunt molestiae ad saepe voluptatem molestiae autem accusamus qui dicta ipsa voluptatem quia commodi ipsa doloribus vel architecto error veritatis provident consectetur aut rerum est qui omnis expedita animi quibusdam soluta unde ad repellat minus ipsa non doloremque et eligendi consequatur accusantium rerum quia necessitatibus vero molestias non perspiciatis accusamus quia enim id sunt eius tenetur vero ut optio sit ut consequatur id incidunt dignissimos excepturi aut et officia incidunt suscipit dolorum culpa a omnis in eligendi.', '1', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('241', '7', 'Non iure laboriosam repudiandae consequatur.', 'Excepturi rem sit quas inventore architecto ipsum tenetur ea amet sed ad dolorem corrupti accusamus et error facere beatae corporis dignissimos fugit animi voluptatem sit velit mollitia sit harum ut vel est atque nemo eum et voluptas atque minus eos reiciendis aperiam quae laboriosam asperiores corporis sint et odit ex est praesentium iste sapiente et culpa aut quidem voluptatum et dolorem et sunt voluptatem qui reiciendis officia itaque est autem voluptatem accusamus porro soluta voluptate repellendus dolore velit quo totam beatae explicabo suscipit accusamus ullam eaque voluptates earum ex ut vel officiis repudiandae eos dolorum in a iste quibusdam aut facilis vitae esse impedit quas est iure eaque vel pariatur consequuntur sint eveniet temporibus vitae odit quam eligendi velit ipsum asperiores voluptas numquam repellat consectetur excepturi quis dolores nisi inventore molestiae blanditiis amet ut nulla necessitatibus accusantium culpa expedita earum quis sit dicta eaque quibusdam sit aliquam porro itaque ipsam dolorem aspernatur sint iure possimus illo dolorem quis nisi sed accusamus et odio dolores vel quasi et molestiae alias et expedita harum et pariatur rem doloremque laboriosam soluta et libero saepe velit reprehenderit architecto ab nemo tempora esse quos aut impedit voluptatem maiores error quia magnam ea non natus voluptatum aut nulla aspernatur reiciendis et architecto modi fugiat et eligendi inventore voluptatem id voluptatem sunt asperiores nihil odio reiciendis quos sint provident explicabo dolor veritatis laudantium omnis quam est iure rem tempora deserunt expedita veritatis qui dolorum explicabo dolor amet asperiores tempora ab quam facere laudantium necessitatibus architecto et harum ipsa omnis blanditiis modi commodi omnis quia quia porro ea illo est quaerat incidunt itaque non dolore expedita officia eaque fugit dolore ut ut animi necessitatibus autem u