INSERT INTO `course_news` VALUES ('242', '8', 'Nobis natus est consequuntur omnis repellat.', 'Aut nesciunt laborum quia qui nesciunt exercitationem harum quia reiciendis id porro ea tempora accusantium eos rerum aut sed hic inventore est nihil nihil voluptatem tempora quis veritatis qui quia velit non animi at quia sit est dolorem et quo magnam pariatur id excepturi consectetur totam nihil quia aut voluptatum ipsam ex voluptatum pariatur quo possimus aspernatur libero quia fugiat fugiat et perferendis reiciendis quasi placeat dolores eum sint maxime facilis sint aliquid amet fugit cum nihil aperiam illum quod rerum sint adipisci accusamus itaque eaque voluptas nemo et aliquam cumque iusto amet voluptatem numquam ipsum quos aliquam quas commodi corrupti natus nihil voluptate enim rerum aut qui id quia fugit nemo nisi exercitationem itaque velit ut nihil eaque iure eligendi et earum laboriosam itaque nisi cum ut sit dicta alias illo quasi facere quidem ea inventore doloremque sit reiciendis provident sunt at sequi blanditiis illo tenetur consequatur vero sunt ex alias maxime nam voluptatem quia voluptatem sed velit ea qui unde facilis aliquid ipsa porro ipsum sed ut ducimus unde doloribus aut provident odit esse pariatur omnis culpa assumenda repellendus aut ea tenetur ea minima magnam minima autem dolor magni voluptas qui sequi ea sunt commodi sed repellat quos omnis maiores consequatur minus rerum culpa culpa qui deserunt doloremque ipsum exercitationem necessitatibus qui nam provident velit aut dolor facere et dolor voluptate suscipit praesentium officiis iusto asperiores consequatur fuga temporibus mollitia est odio reiciendis veritatis quis soluta dolor ex reiciendis assumenda expedita repudiandae quod hic dolores minus doloremque laboriosam officiis voluptates voluptatibus libero rerum iste facere et aut dolor maiores soluta voluptatem rerum aperiam dolore minima quis deserunt et culpa incidunt expedita dolores est consequatur et sunt cum eos consectetur a aut.', '1', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('243', '9', 'Velit aspernatur fugit deleniti rerum eaque id earum.', 'Perferendis consequatur perferendis sed totam sunt non et sed soluta iusto ducimus et sunt ullam consequatur molestiae deserunt amet amet dolor autem nam illo laudantium recusandae harum sit perferendis sed enim harum dolor voluptas voluptas molestias officiis consequatur autem assumenda ut rem voluptatum praesentium harum magni cumque fuga et dignissimos molestiae accusamus impedit odit est molestiae accusamus eum est porro illo et animi consequuntur necessitatibus ut hic nemo eveniet facere dolor repellendus nam iusto molestias ut minus nemo vel est iste asperiores dolores incidunt dolores incidunt eum est voluptatibus tempore est consequatur et voluptas sint consequatur aperiam repellendus recusandae ipsam molestias culpa eum error architecto voluptas ab repudiandae consequatur inventore consequatur qui et odio maxime molestias officiis cumque aspernatur numquam officia fugit ducimus quaerat atque sunt inventore veniam aut dolorum amet repudiandae rem rerum sunt beatae quo vel vero nostrum neque delectus sit quo est minus quisquam consequatur fugiat veniam ad asperiores illum voluptate id excepturi nobis aliquid et deleniti quod eum fugiat qui dolore harum iste molestias et rem tempora pariatur quis molestiae sit cupiditate recusandae error et vel rerum nihil voluptatem consectetur ea ut et delectus iste sed sit quibusdam sunt sunt iste earum a et autem accusamus architecto pariatur corporis nulla id nam est iste quibusdam molestiae facere libero aut dolores occaecati qui exercitationem fugiat enim dolorum non enim quo magnam vel natus amet aut et molestiae quibusdam voluptatem facere quidem tenetur illo sed voluptatem optio facilis error.', '1', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('244', '6', 'Laborum pariatur est rem dolorem aut voluptatem.', 'Voluptas eum molestiae ex ad perspiciatis quae officiis qui omnis sed dolore voluptate distinctio consequatur temporibus sed non quibusdam eum vel officiis doloremque accusamus provident placeat praesentium et non voluptas minus nemo minus occaecati dolor tempora sint nostrum perspiciatis quasi ea ut rerum sequi natus amet dignissimos quia illo qui vel cupiditate voluptatem dolor sapiente illo et voluptas autem vel non quia cumque fugiat voluptatem cumque voluptates similique autem enim nisi quod quo quae sit adipisci explicabo et nisi quam magni vitae ex cumque ab ea non tempore harum consequatur natus enim sequi deleniti sed voluptatem magni sed molestiae reprehenderit inventore autem assumenda quam dolorem porro sunt esse adipisci eligendi eum aspernatur aut ut qui ducimus voluptate possimus molestiae illo quam voluptates ullam tempore cum dolorem quaerat labore dolorem sapiente sed aut officia aperiam eos quia libero voluptatem et nemo aperiam et aperiam deleniti excepturi quod iste qui ut sed nesciunt excepturi facilis eum ut tempore aspernatur praesentium corrupti est et velit similique facere ducimus quae et autem est accusantium est sapiente eligendi ut amet dolores veritatis sapiente incidunt ut qui quam nostrum est facere nobis voluptatum ipsam voluptatem dolor voluptas quae voluptatem dolor omnis amet debitis et veritatis sint perferendis et voluptatem eum occaecati repudiandae eos quaerat aliquam repellendus atque sequi repudiandae distinctio blanditiis est ratione voluptatibus sit sapiente quam iure voluptatibus voluptate sunt et aliquam odit sit assumenda vitae ipsum veritatis non sint qui distinctio et fugit facere quia odit nulla suscipit repudiandae sed saepe quia beatae perferendis in corrupti repellendus consequatur quis architecto id quae excepturi error repudiandae ea beatae vitae aspernatur doloribus suscipit esse error nesciunt facilis et harum quaerat earum maiores minus quia nihil enim beatae veniam perferendis nam odit rerum labore dolor et nemo iure temporibus et quas soluta atque quod consequuntur debitis ullam quia aut ad id exercitationem repellat cum minus est et soluta quasi quia aliquid atque quo qui doloremque explicabo necessitatibus illum est voluptatem aut doloremque illum non enim labore nesciunt temporibus necessitatibus enim sequi officiis corrupti in odit dicta exercitationem doloremque consequuntur vel velit blanditiis amet accusantium quia et magnam et ipsum ratione autem unde odio nostrum nihil tempora voluptates voluptatem quisquam sit et autem aut ut vel repellat qui aperiam aliquam harum vel itaque voluptas.', '1', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('245', '5', 'In pariatur fuga fuga fuga tempora hic.', 'Nesciunt consectetur tenetur ipsa fuga impedit quo laborum qui qui consectetur fugit laborum excepturi non sunt voluptatem aut qui ipsam possimus dolor itaque repellat unde ipsum nisi consequuntur dolore ut sit ut eum voluptates nihil modi velit aperiam a molestias harum autem voluptas in cum eaque repellendus velit aut eos illum harum in quis harum provident qui quos possimus tenetur ex culpa ea veniam excepturi molestias reiciendis aut qui accusantium fuga repellat iste voluptatem quos ut aut sit illo aut aliquid possimus libero eum incidunt provident eveniet qui dolores aut eveniet quia alias eos mollitia id quia amet omnis hic nesciunt provident dolorum est necessitatibus sint ea natus repellendus architecto expedita quis natus laborum dolores aut vitae in quas ratione impedit porro iste quo molestias nulla commodi voluptas eos eos sit et qui et ex quod vel aut voluptas doloribus aut rerum optio dolorem ea quis et repellat non vitae sunt unde odio autem quod ea eos facere nihil ut mollitia alias aperiam est quidem cupiditate sunt nobis deserunt repellendus nisi repellat sint sapiente eum beatae cum consectetur eos sed optio id eveniet impedit voluptatem consectetur qui odio ea laboriosam ipsa odit voluptatem temporibus est ut nostrum consequatur voluptatum laudantium pariatur nihil id est quia temporibus recusandae perferendis in magnam consequatur dolor enim est quia debitis beatae eum sed velit iusto vitae exercitationem magni distinctio veniam molestias quos voluptate consequatur dolores et impedit ea et atque iure fuga deserunt quidem vero eius et eaque placeat unde eum necessitatibus molestias et veritatis ullam consequatur illum ut fuga voluptatum quo voluptas iusto facilis temporibus perspiciatis impedit cupiditate incidunt saepe animi soluta nihil eaque vitae reiciendis quidem blanditiis dolores nobis aut occaecati ut qui saepe sit et non consequatur velit sapiente modi enim et optio ipsa architecto quia repellendus unde non nihil molestiae modi sint necessitatibus sed ut dicta aut labore nostrum ut odio vel est aut ab dolore et dolores sed praesentium ut quaerat maiores numquam molestiae eos ratione in consequatur dolores porro minima consequatur omnis deleniti sunt inventore laudantium veniam ipsa ab a voluptatum ea autem ut sunt magni molestiae accusantium molestiae optio natus maxime et rerum labore laboriosam sed iure ea et suscipit modi qui pariatur eos iure non alias nihil quod pariatur a id enim tenetur pariatur tenetur reiciendis debitis cumque error libero aperiam porro et quis quas atque quod culpa ut et quibusdam neque unde officiis quos non nisi aut quis laboriosam rem alias modi incidunt est.', '0', '2017-05-02 22:58:58', '2017-05-02 22:58:58');
INSERT INTO `course_news` VALUES ('246', '7', 'Cumque aut non sed omnis.', 'Possimus quo itaque quia quia odit ullam asperiores molestias et consequatur debitis quae reprehenderit voluptatem eveniet sequi illo et harum atque dicta voluptatem consectetur eum architecto repellendus tempora atque optio modi occaecati minima consectetur corporis omnis odit deleniti unde unde perferendis ut nemo quae in optio similique delectus voluptates velit deserunt ipsum laboriosam cum nisi fugiat impedit iure culpa aspernatur at recusandae molestiae deleniti ea voluptas soluta tempore eaque excepturi optio aut molestiae molestiae animi quis quo rerum et animi iusto reiciendis nihil esse consequatur assumenda eligendi vel voluptatum consequatur eligendi necessitatibus deleniti incidunt sint aut distinctio voluptatem temporibus nulla quae et voluptates asperiores fuga excepturi non nesciunt non pariatur earum ab quis porro at excepturi voluptates magnam doloremque aut omnis ratione consequatur ex enim similique qui qui dignissimos possimus quos nesciunt officia natus voluptas illum dolorem sed soluta et in doloribus molestiae ullam ut illo quo neque doloribus eos ab qui enim cupiditate ratione corrupti aut debitis sapiente dolorem quaerat mollitia odio eum quod ullam odit accusantium perspiciatis qui asperiores id nam voluptas autem nihil beatae repudiandae aliquid exercitationem quasi dignissimos laudantium quam porro neque exercitationem enim voluptatem qui eligendi nesciunt totam tenetur omnis ipsa porro tempore dignissimos adipisci occaecati mollitia sunt sint debitis nostrum ut voluptate ut vitae et cupiditate cupiditate excepturi consequatur quo velit deleniti cum veritatis architecto rem commodi quae mollitia et similique nihil sed ut dolor magni maxime deleniti facere veniam quia optio sunt vero facere at earum nihil vel ut deleniti voluptas eveniet rerum blanditiis hic error velit nihil neque laborum itaque aut aliquid voluptatem aut beatae ut sit quidem id qui magni veritatis quod minima ex necessitatibus assumenda sed et sit voluptas ut hic ad eligendi ipsam vero in voluptas recusandae ea nihil sed rem est enim est nisi at et quo magnam qui quibusdam reiciendis qui cumque veritatis molestiae rerum sint deserunt ea exercitationem eos illo eaque et quis sed ex laudantium aliquam qui ipsum aut perspiciatis tempora distinctio deserunt est rerum quis reiciendis voluptatem aliquam quia voluptatem consectetur qui aut accusantium debitis aspernatur sint eius voluptatem quo.', '0', '2017-05-02 22:58:59', '2017-05-02 22:58:59');
INSERT INTO `course_news` VALUES ('247', '7', 'Et quo repellat quod dolores soluta expedita aut.', 'Distinctio voluptatem placeat ipsum voluptatem autem dolorem quia dolores nostrum et nisi odit asperiores saepe dolorum ut cupiditate assumenda id velit fugiat aperiam et vero nisi voluptatibus corporis nihil id aut adipisci fugiat sequi est autem dolor illum sapiente repellat rem ea nesciunt ut est labore rem quae dolores beatae voluptatem occaecati eos quod at vitae occaecati inventore veritatis praesentium assumenda illo vero unde mollitia eos laboriosam saepe ab ut nostrum provident voluptatem ea accusantium iure perspiciatis beatae similique consectetur illo expedita natus id qui nostrum in voluptatem perferendis sequi animi aliquid veritatis commodi non ab non rem ea similique quis at quo amet atque tempora maxime esse amet dolorem nisi porro perferendis animi aut est consectetur ratione odio ea aut accusamus ab maxime nihil eaque blanditiis temporibus nemo voluptate perferendis sed atque error aut repellat voluptatem sit maxime ratione laudantium et optio est delectus perspiciatis enim aut sed sint rerum ab consequatur dolore sunt ut qui velit dignissimos qui itaque velit doloremque molestias officia impedit quam magni dolores magnam et reiciendis sint blanditiis quia laboriosam quasi dolorum sapiente ipsam architecto perspiciatis rerum minus.', '0', '2017-05-02 22:58:59', '2017-05-02 22:58:59');
INSERT INTO `course_news` VALUES ('248', '9', 'Et ut libero sapiente reprehenderit in est aut et.', 'Inventore et voluptate sunt tenetur iusto ipsum nihil sint saepe mollitia aperiam non explicabo eaque laudantium molestiae eum dolorem consectetur maxime qui dolore nesciunt nobis voluptas architecto non vel molestiae optio illum dolores molestiae tenetur autem qui ad ut qui aliquam quia et ut dolorum ut atque est omnis et commodi qui eligendi et nemo doloribus nam harum accusantium et qui quibusdam soluta aut veritatis sapiente est eum omnis et excepturi voluptates explicabo fugit quisquam sed labore est omnis deleniti voluptas eligendi dolore perspiciatis unde eaque hic molestias porro dolorem facere dicta iste voluptatibus sapiente adipisci iste eum doloribus et voluptas dolorem sit sed et qui est harum rerum sunt sed eos voluptatem deleniti quos dolorum ut dolorem repellendus optio doloremque sit ratione rerum rerum quis sint at eum dolores ut qui et fuga omnis nobis qui ratione aut adipisci voluptatem dolor nisi culpa voluptatibus provident voluptate veniam omnis rerum illo perspiciatis autem sequi aut ratione ut rem molestias id ipsa ea in ut perspiciatis aut blanditiis officiis porro distinctio nisi eveniet quia eveniet rem natus consequatur debitis nulla enim sit odio aut quas sunt nulla adipisci qui ut deleniti laborum ad consequuntur rerum a architecto eaque voluptas facere totam possimus maxime rerum exercitationem harum et qui exercitationem adipisci maiores quos et ullam fuga aut ut fugiat totam natus molestias eum quae accusamus molestiae et minima facere sit incidunt est dolores dolore recusandae ipsam reiciendis illo rem non mollitia est blanditiis et et tenetur corrupti placeat reprehenderit est blanditiis id quaerat sed qui impedit beatae ut adipisci odit illo numquam eius repudiandae tenetur adipisci qui voluptatibus harum voluptas dolores qui corrupti repellendus magnam ratione cumque excepturi consequatur beatae sunt doloribus perspiciatis nam quia numquam quibusdam nihil amet laborum sit quia dolore sunt eos earum perspiciatis vero sunt itaque optio corporis non perferendis rerum excepturi harum aspernatur nam sunt aperiam rem qui animi magni iste assumenda enim voluptas ducimus molestias labore non voluptas amet iure debitis iusto necessitatibus provident omnis modi velit quae aut sed molestiae corrupti quae commodi velit tempora iusto excepturi ab accusantium id molestiae quia minus aliquam ipsum praesentium dolorum aliquid est voluptatem necessitatibus facere occaecati voluptates reprehenderit distinctio facere aut iure fuga aliquid laborum sint hic temporibus nisi dolorum aut perspiciatis illum ut fuga modi perspiciatis quis sint impedit velit aut ex perferendis occaecati molestias nulla nisi magnam animi accusantium quia rerum quia adipisci quo distinctio laudantium ut ab molestias asperiores voluptate suscipit in est aliquid.', '1', '2017-05-02 22:58:59', '2017-05-02 22:58:59');
INSERT INTO `course_news` VALUES ('249', '1', 'Impedit quaerat vel sit quo provident.', 'Repellat ut sapiente quidem doloribus autem cumque quidem recusandae veritatis aspernatur et mollitia omnis est veritatis suscipit sit voluptates voluptas sit quia nihil corporis sit eos repellat aut vel optio alias mollitia quia ut nulla quod qui ut deleniti debitis optio est facilis ducimus quasi fugit sint amet eos rerum perspiciatis qui nostrum impedit deserunt et esse quibusdam laboriosam quia qui in fugit eveniet aut reiciendis et labore labore sunt cumque laborum nesciunt cupiditate voluptas odio qui mollitia quis sunt numquam autem nisi soluta velit accusamus est itaque unde eum non iste doloribus cumque odio earum rem et enim praesentium veniam magnam corporis consequatur reiciendis aspernatur rerum dicta laudantium ut repellendus aliquam maxime totam laudantium nihil occaecati at ullam quo architecto neque sint non veniam earum sit nisi laboriosam et pariatur beatae explicabo quasi temporibus at doloribus et enim minus praesentium sequi animi quibusdam fugiat aut necessitatibus ipsum officiis omnis temporibus cumque veniam reiciendis voluptatibus animi excepturi odit in itaque corporis sint eum et voluptates maxime autem voluptates quo quisquam vel consequuntur dolores quia et sed voluptas quis deleniti alias ipsum atque ipsam et quo qui vel natus voluptates aut omnis et corrupti rerum repellat nesciunt occaecati praesentium illum qui aut aut et non dignissimos voluptates ut voluptatem deserunt ut aliquam optio quasi sequi facilis fugiat doloribus laboriosam mollitia magnam eaque ut rem dolores excepturi repellat incidunt provident reiciendis quidem eum minus libero dolorum voluptas quia eligendi rerum dolorem tenetur facilis quas cum sit placeat aut est sed distinctio vero necessitatibus repudiandae modi aut vel consequatur deleniti labore blanditiis sit repellat quia vitae a magnam facilis aliquid aperiam pariatur ut blanditiis occaecati enim omnis dolores velit vita