INSERT INTO `course_news` VALUES ('250', '10', 'Praesentium nam ex qui vero corrupti animi.', 'Numquam sit impedit deleniti iste et architecto et id facilis rerum perferendis aspernatur voluptas aut ut incidunt et illum cumque deserunt et laudantium consequatur atque nulla recusandae blanditiis quas aut earum enim ab corrupti dolor repellat tenetur accusantium et atque atque consequatur omnis qui similique qui quidem qui repellat numquam corporis voluptatem tenetur nihil velit eveniet in nostrum est sunt aut nisi dolorum praesentium id dolores illum ea corrupti placeat expedita cumque laborum accusamus molestiae asperiores enim deserunt corrupti odit iure amet veniam id nesciunt nam magnam temporibus exercitationem non expedita quam praesentium eligendi qui labore quia corrupti ipsa atque nihil voluptatem modi tenetur ea dolorem incidunt est ea cum consequatur omnis earum omnis enim id dolor esse maiores sit et sapiente blanditiis nesciunt et totam quia et facere voluptatibus ut omnis facilis assumenda et earum occaecati laborum numquam explicabo est eum aut culpa harum quidem voluptas totam nam sed dolores dolor architecto odio laborum id laudantium commodi sint neque ut enim sint et at tempore iusto earum omnis consequatur eius neque quo velit alias deserunt dolore iste consequatur explicabo in saepe enim est vel vero minus exercitationem rem dignissimos accusamus delectus occaecati perspiciatis at voluptatem vel cum atque deleniti explicabo soluta voluptatem facilis doloribus rerum possimus ut explicabo assumenda nam ut ut esse aliquam rerum cupiditate ut ad suscipit ut dolorem perspiciatis consequatur laudantium repellat laboriosam voluptatem tempore officia fugit deserunt qui quaerat omnis unde laboriosam id aut quo maxime odit enim ut harum consequatur quae aliquam accusamus quos quae omnis cum dignissimos sed omnis dolorem culpa totam quas est dolor et velit adipisci dolorem reprehenderit dolor delectus doloremque dolor est eum laboriosam excepturi qui et vol