INSERT INTO `course_news` VALUES ('252', '7', 'Incidunt est dolorem cupiditate velit alias vel.', 'Inventore nostrum fuga ut dolores aut atque minus repellat sed sunt et modi non porro eos iure omnis est repellat numquam cum ducimus iure in rerum optio dignissimos qui omnis hic dolore quo quam dicta ab quia ullam iure quis magnam eius vero excepturi voluptatem ut neque quia et cumque dicta aut numquam et consequatur qui tenetur neque doloremque est hic recusandae eius est est magni ex similique commodi incidunt sapiente excepturi quibusdam rerum incidunt quidem architecto veniam atque in molestias libero nulla fugiat aut et magnam magnam dolor dolorum ex provident dolorem est expedita ipsam velit facere occaecati reprehenderit ratione dolorem autem maxime quam asperiores voluptatem sed cupiditate culpa iste vitae facilis consequuntur enim cum voluptates fuga vel at nobis distinctio explicabo commodi et aliquam quas ut est esse explicabo sapiente perferendis fugit fuga temporibus rerum consequatur et rerum architecto enim molestias sint et dolores deleniti est laborum minima quod consequatur ad aspernatur voluptates voluptatem vel voluptatem pariatur sint laudantium nesciunt eligendi omnis architecto sed perferendis unde eum eos in temporibus sunt omnis facere nemo placeat minus et asperiores possimus possimus nemo modi suscipit voluptatem accusamus deserunt laborum maiores blanditiis ex amet nobis culpa dolorem aut quam aliquam molestiae rerum voluptas tempora voluptatibus quo et commodi modi aut placeat quasi in magni amet nihil corporis aliquam iusto et quam qui minus neque sed voluptatem deleniti sed eaque temporibus nihil minima laborum omnis quibusdam delectus non quae voluptatem consectetur consequatur eaque velit ratione exercitationem dolorem dignissimos a rerum nemo doloremque.', '1', '2017-05-02 22:58:59', '2017-05-02 22:58:59');
INSERT INTO `course_news` VALUES ('253', '4', 'Aut accusamus voluptatem quo eos qui.', 'Eius ut et quia est ab iure praesentium enim expedita ut nemo asperiores quo et quia omnis rem non vel qui occaecati est molestiae eaque qui vitae dignissimos voluptatem molestias delectus laudantium autem sit voluptatum earum eum minima quos eum repudiandae fugit ab eveniet laboriosam id fuga quia excepturi aperiam magni iure voluptate quia qui maiores unde modi quia et quia minima aut et neque corrupti eum beatae et nihil ut voluptate facere ex minus ullam illo fuga est officiis voluptas mollitia corrupti maiores deserunt quidem quas totam facere quia ea consequatur ipsa fugit corporis nihil expedita eaque aspernatur dolorem expedita sed aliquid temporibus perspiciatis quidem vero tempore hic vel ea fuga consequatur eaque nulla pariatur dolor non excepturi consequuntur ducimus culpa temporibus repudiandae aspernatur dicta iusto rerum molestias distinctio a assumenda voluptate cupiditate nihil non eum nulla architecto asperiores tempore ex consequuntur quaerat perferendis aut eveniet quas sed et qui commodi eaque et ab est temporibus ullam quisquam ab doloremque rerum nihil rerum harum consequuntur aut quia voluptatem quis et exercitationem ipsam esse dignissimos laboriosam quibusdam atque harum dicta tempora est harum doloribus iste cum similique exercitationem vel sapiente sit dolorem tempore possimus quibusdam molestiae nostrum exercitationem ipsam quaerat maiores harum beatae quisquam eligendi accusantium molestiae quasi odit nam quam aut blanditiis deleniti voluptatum quas voluptas aut necessitatibus error doloremque possimus sint mollitia excepturi possimus hic enim omnis facere laboriosam ut praesentium et et quaerat qui amet blanditiis eveniet deserunt beatae dolores omnis deleniti quas quos quas exercitationem assumenda asperiores omnis eum repudiandae quod ad neque voluptatem ab eos non sit aut in alias nisi consequuntur voluptas quae voluptatum aut et aut enim eius co