INSERT INTO `course_news` VALUES ('254', '6', 'Rerum aspernatur doloremque commodi vel voluptas fugit architecto.', 'Harum quisquam quis harum necessitatibus veritatis similique sed quas autem molestiae saepe soluta ut id repellendus eos rem enim earum quibusdam qui id enim eveniet aut dolores cum corporis rerum sed laborum quam nemo reiciendis itaque aut assumenda laboriosam magnam accusantium totam aut temporibus qui officiis voluptates quo labore rem quia aut facere aspernatur ab temporibus aperiam saepe sint eos ipsam sit mollitia qui eaque harum molestiae veritatis at ea asperiores facilis ut sed ut consequatur esse illo et aliquam repellat consequatur qui ducimus et sit quaerat at explicabo velit eaque sunt sit labore earum molestiae consequuntur nostrum vel possimus tenetur vero consequuntur officiis id non ullam et aut sunt dolore aut possimus voluptatem ex mollitia in sit repudiandae dolores commodi ut consequatur voluptatem accusamus eius blanditiis qui minima impedit veritatis molestiae qui magnam earum dolor quod distinctio beatae iure officiis iure rerum sit aut est autem molestiae et vitae beatae et modi ut sequi fuga veniam autem ad qui ut facere quo dolore sequi reprehenderit necessitatibus dolorem expedita non omnis nam deserunt est ut cum sed rerum velit sapiente sint quae consequatur suscipit ipsa qui consequatur qui ab numquam cupiditate sunt totam error deleniti vitae rerum ut quia dolor doloribus atque quae dolorem laborum sunt sed a accusamus asperiores nemo animi repellendus id repellat non earum nihil id vel aliquid saepe est commodi omnis possimus.', '1', '2017-05-02 22:58:59', '2017-05-02 22:58:59');
INSERT INTO `course_news` VALUES ('255', '9', 'Fugit quia possimus deleniti quas ea qui.', 'Et fugiat sed est voluptas qui autem sit quos repudiandae nihil voluptatum distinctio impedit vero harum dolor commodi et repudiandae nobis eius quam sed et facere possimus non voluptas sed quod omnis qui numquam sint est et vitae rerum dicta sed repudiandae eos iusto voluptas tempore ut expedita ea consequatur porro consequatur quisquam aut sint ut asperiores ut sint ut aut quod perferendis sed qui reiciendis deserunt maiores a omnis est eos cum perspiciatis repudiandae voluptatem molestias enim dolores aspernatur deserunt excepturi id nobis aut sequi nesciunt assumenda quaerat et et praesentium voluptatum sint nemo enim accusantium reiciendis quidem necessitatibus tempore et et omnis rerum repudiandae voluptas autem corrupti aut eaque suscipit voluptatum quidem sit itaque voluptas sunt aut quisquam eius et molestiae nostrum excepturi quibusdam quae provident qui aut culpa dolore impedit ipsa error odio quae magni cum sed eos sint laudantium sed autem voluptas esse et voluptatibus cumque iusto molestias saepe amet aut id velit non nihil dolor reiciendis dolore enim quidem sed cumque reiciendis velit iusto illo illum modi consequatur debitis est libero numquam dolores repellendus quia sapiente incidunt quibusdam impedit ut beatae modi quia dicta ullam rerum ratione voluptas est sunt modi dolorem ea exercitationem ipsam eum inventore voluptatem aliquid consequuntur et sint aut earum nam maxime doloremque et odio rerum quo tempore fugit eum earum corrupti cupiditate inventore suscipit quos nostrum occaecati facilis ut ducimus magnam in quia ratione pariatur dolor pariatur eos animi cumque quo libero et quod id voluptas perferendis quae et deleniti vel ut nam quis deleniti dignissimos dolorum exercitationem sit enim at consequatur fuga assumenda repellendus nostrum qui ea eum odio et qui aut excepturi nihil eum repudiandae qui aut sequi sunt reiciendis reiciendis ducimus sed fac