INSERT INTO `course_news` VALUES ('256', '1', 'Doloribus ex velit consequatur porro nesciunt.', 'Eaque dolorem consequuntur odio occaecati occaecati voluptas odit sit quasi quidem quaerat aut vel aut vero quis tempore quia vel similique ad dolorum excepturi doloremque error magnam ullam enim nulla sit et mollitia nihil aut ab quos est necessitatibus officiis accusamus commodi occaecati possimus dignissimos ex enim illo harum voluptatem recusandae voluptatem architecto ipsum rem dolor eveniet rerum qui omnis odit hic voluptatem accusantium saepe ad soluta ea praesentium sint iure accusantium libero dolorem eligendi quisquam ipsum veniam aut eaque praesentium similique saepe voluptas modi incidunt provident omnis ut doloremque exercitationem et voluptas voluptates ratione est fugiat quos doloribus vel eum non repudiandae laboriosam minima nisi similique in ratione sed sunt voluptatibus consequatur enim sed rerum dolorem totam quibusdam voluptas consequatur debitis quia unde deserunt aut ex odio sit cupiditate laborum quam maiores eos reiciendis est voluptas sed ex officia illo iusto labore ex eius nulla suscipit in et quibusdam neque ab officia voluptatem rem vel necessitatibus et possimus sed facilis commodi deleniti quaerat fugiat incidunt dolorum deleniti sed consequatur facere eveniet aliquid reiciendis laudantium eum voluptate eum earum distinctio itaque repellat suscipit animi molestiae necessitatibus sunt occaecati ut vero voluptas dignissimos et a dolores sed enim repellat magnam tempora aut iste tempore eveniet rerum occaecati dicta deleniti officia esse maiores provident fugit cumque iste dolor dolores eligendi quasi quis labore dolore amet quae rerum id porro quia vitae id necessitatibus cum id doloribus eos sed tempora sit consequatur consequatur voluptas harum eveniet unde porro culpa quod odit veritatis dignissimos itaque nemo nesciunt officia iste animi assumenda consequuntur omnis voluptatem repellat commodi.', '0', '2017-05-02 22:58:59', '2017-05-02 2