INSERT INTO `course_news` VALUES ('257', '9', 'Nihil inventore quam consequatur quas sit rem porro.', 'Rerum debitis ex rerum esse magnam dolores aperiam qui rerum inventore dolor neque voluptatem sunt autem officia ut repellat eos et error aut soluta corrupti tempora voluptatem quas vero error cumque facere adipisci eum harum illo cupiditate molestiae illo aliquam commodi sint laboriosam placeat officiis occaecati ea quis vitae possimus non ut facilis minus nemo est nihil maxime rerum sit quia aliquam repellendus dolorem veniam rerum omnis ut ab cum sint et sit voluptatem officiis expedita deleniti ratione officiis eos error est est incidunt error nobis quae repellendus nisi asperiores aperiam accusamus modi iusto similique reiciendis asperiores praesentium sunt occaecati doloremque velit omnis dolor nihil et labore quo itaque nam asperiores quia dolores consequuntur autem ut vero cumque error debitis amet velit ullam rerum error officia soluta voluptas earum blanditiis rerum quas explicabo ipsum voluptatem necessitatibus sed qui maiores nesciunt illum assumenda reprehenderit rerum odio voluptatem et numquam omnis sapiente blanditiis cumque totam consectetur corporis dolores laudantium officiis ratione nam officiis dolor quae suscipit modi quia rerum minus illum non et rem perferendis tenetur aut quod quae quibusdam reiciendis architecto repellat vel voluptatem vel voluptates excepturi non neque non rerum hic rem quis voluptas suscipit mollitia harum ipsam et nam et nihil consectetur doloribus praesentium id voluptate voluptas vero incidunt dolorum et facilis laboriosam tenetur expedita nihil sapiente optio nam perspiciatis ut aperiam aut voluptatem rerum aspernatur fugit nostrum aliquid ipsam dicta minus eaque fuga molestiae at molestiae occaecati officiis iste vero sunt neque sed nulla veniam rerum eius dignissimos quis officia ut et veniam dicta neque dolorem fugit quidem animi id in eveniet fugiat tempora at voluptas ut perspiciatis unde quia ut beatae optio te