INSERT INTO `course_news` VALUES ('258', '4', 'Sit voluptas ut et sed veritatis optio.', 'Aut in iste quis quae id et sunt sapiente at est perspiciatis recusandae veritatis commodi et tempora quia aperiam perferendis quibusdam voluptates autem odio voluptatem voluptatem quisquam molestiae expedita enim enim dolor voluptatem facere enim blanditiis accusamus ratione magni culpa explicabo molestiae qui dolorum aut excepturi nobis est eaque aut vel cum vitae corporis omnis esse a ad numquam aut optio et ratione harum est qui est dolores culpa cupiditate neque reprehenderit quos eum dolor omnis quis quia magnam enim esse consequatur voluptatibus tenetur ex neque sint veritatis molestias enim nemo blanditiis ea illo vel quia occaecati debitis ad velit ipsam omnis excepturi necessitatibus a sapiente animi nesciunt nobis eum ut iste enim deleniti quis non voluptas cum dolorum minima et sed corrupti maxime et minus accusantium culpa voluptates itaque repellendus aut deserunt repellat fuga eaque qui qui impedit atque animi impedit id quos voluptate ratione praesentium atque eligendi impedit molestiae natus voluptate molestiae quasi rerum est rerum est ex sit rerum nihil non ea praesentium qui nostrum nihil dolorem aut quisquam qui praesentium modi voluptatem rerum quos quas suscipit impedit omnis aut et aperiam sit aut ullam quo itaque enim voluptatem optio aut soluta sint est enim et officiis aperiam repudiandae amet porro nobis aspernatur accusantium repellat aut vitae quae in placeat ipsum nemo consequatur officia nulla laboriosam expedita nihil possimus est consequuntur quis unde odio odit cumque velit aperiam pariatur ullam repellendus quibusdam voluptas officiis velit tempora qui nihil magni quia cupiditate ex ut quos sed temporibus quia officiis aut ratione exercitationem unde ea itaque molestias corporis illo facere sint deserunt quo nihil voluptatem facilis eum eos et delectus sint doloribus ullam culpa quasi recusandae aliquid expedita voluptatem et quo voluptatem s