INSERT INTO `course_news` VALUES ('260', '6', 'Quia suscipit accusamus ut et illo.', 'Voluptatem necessitatibus nihil aut voluptatum hic vero voluptatem distinctio praesentium quia qui ipsa qui debitis exercitationem necessitatibus ut eos ad consequatur vero nihil dicta error reiciendis quis voluptas debitis sint et aperiam dignissimos repellat dolorum qui fuga voluptatum id quia sit ut velit consectetur sint omnis molestias non nostrum repellendus nulla sed est nam suscipit sint est sed qui deserunt fuga et qui aut tenetur perspiciatis et nihil omnis sequi qui est soluta ad nemo laborum ratione est excepturi perferendis doloremque fugit dolorem autem nam omnis similique iste dolorem quia quidem veritatis alias nisi eum eius exercitationem quia quas saepe vitae molestias sint distinctio non sunt necessitatibus ratione veniam molestiae debitis voluptatem iusto incidunt sit ipsa deserunt est quia fugiat beatae quis asperiores consequatur deserunt doloremque ea impedit sit ut architecto et omnis dolore ad animi ullam harum qui aut ut cumque doloremque est ut ea quaerat et deserunt magnam sed accusamus consectetur aut delectus itaque labore nihil nobis ea impedit rerum ut distinctio fugit dolore distinctio rem voluptas consequatur a libero modi quia aperiam consequatur sint dolorum maiores laudantium maiores voluptas culpa laudantium voluptas nemo possimus deleniti sequi itaque eveniet sed et quaerat est earum perspiciatis consequatur numquam consequatur unde odio quia perspiciatis autem nostrum repellendus aliquid fugiat aliquam et facilis ut et sit nesciunt deserunt deleniti molestias nesciunt eaque neque minima sapiente reiciendis quaerat aut accusamus asperiores consectetur et veniam nam dolores facere dolorum laborum dolores sapiente cumque reprehenderit eum enim saepe maiores excepturi earum maiores minus mollitia rerum ea voluptatem dolor placeat pariatur fugiat nobis nam maiores sunt nulla illo omnis odio et esse aspernatur natus odio qui voluptatem tempore et v