INSERT INTO `course_news` VALUES ('263', '3', 'Dolorum ex qui fugit ut explicabo.', 'Reprehenderit sed nihil quasi sed deleniti occaecati rerum aliquam libero et quia minus tenetur et ab harum odit eveniet ut officia itaque aut suscipit eos minus veritatis excepturi modi et itaque architecto repellendus illo ut incidunt beatae sequi corporis quis porro corporis ut voluptatum ut perspiciatis quia voluptates earum ea minima magnam ut et quaerat sint distinctio at omnis inventore ut veniam incidunt quia libero cupiditate officiis a asperiores ea quam numquam temporibus est suscipit repudiandae et voluptas vero at dignissimos quam illo eos veniam rerum amet est voluptas quisquam ab modi ea ea quae laudantium non ea harum voluptatibus dolor facilis et libero porro et repellat laborum eius inventore rerum vitae voluptas corporis autem ea minima doloribus voluptatem omnis aut recusandae soluta voluptatem voluptatem est autem expedita voluptatem deleniti ipsam ut voluptatem omnis ut dolores ipsa et aut excepturi autem sed cum harum ullam enim assumenda ut quia dolores ab similique et aut eaque enim quis fugiat qui numquam voluptatem quo soluta excepturi adipisci sint quisquam quia asperiores eos rerum possimus qui adipisci ullam est eaque reprehenderit repellat neque ipsum ab eos quasi dolorum consequatur labore blanditiis explicabo voluptas quas dolorum saepe ut aut quod iure aliquid quia earum iste nisi iusto aspernatur quos asperiores at quas et a vero omnis reiciendis provident consectetur nemo est est corporis iusto omnis totam dignissimos fugiat repellat tempore sint debitis ut voluptas est consequatur non repellat possimus dolorem et natus nobis assumenda nostrum ab distinctio ipsam qui in voluptatum molestias ipsum ex fuga eveniet beatae possimus non vel saepe nobis assumenda eius qui omnis et eius earum sed dolorem dolorem praesentium nisi iste accusamus nesciunt et qui et ullam ullam earum enim mollitia labore est deleniti asperiores quo eos ducimus voluptate aliq