INSERT INTO `course_news` VALUES ('271', '3', 'Iste in omnis et non non eveniet molestias.', 'Omnis est quae et officiis iusto eum architecto nam placeat est autem et a unde sed esse nihil vel odit aliquid eum facilis iste pariatur qui quasi perferendis laboriosam sint temporibus ut perferendis aliquid rerum dolores dicta vel maxime suscipit blanditiis dolores porro voluptates et nesciunt delectus eligendi expedita quia sed id fugit minima in et ducimus dolor et rerum et molestiae quos dolorum itaque dolor odio accusamus eos eaque dolor ipsam officiis in ut ab vel ad minima corporis iure aperiam fugiat corrupti temporibus quis ut nihil quod quidem at assumenda et porro accusamus nulla ut et sit blanditiis dignissimos quae omnis nisi et occaecati qui temporibus cum sunt adipisci nesciunt et quasi quasi maxime nam aut ipsum modi fuga unde est et iusto temporibus suscipit earum recusandae nobis aliquam quos facere qui saepe aperiam necessitatibus quo dolores sint modi rem inventore aut voluptas iure quia id dolore nihil iure dolores deserunt ad doloribus rerum voluptatum distinctio ipsa labore voluptates dignissimos culpa quae incidunt perferendis harum consequatur blanditiis aperiam vel tempore et quia corrupti voluptas magnam voluptas exercitationem voluptates eveniet expedita et eius quae accusamus omnis delectus porro libero nulla nam sapiente non esse et voluptatem dolore optio eum aspernatur optio dolore tenetur ipsam corporis et cum impedit voluptatem occaecati eum at odit placeat dolores molestiae suscipit itaque eius aliquid et ex eos ipsam in est qui omnis tempora unde aliquid ut quia similique dolorem ab ut ratione quos eligendi accusamus quisquam reiciendis itaque corporis aut omnis adipisci eaque reprehenderit eaque quis sit et ducimus voluptatem officiis est porro ea alias laudantium modi dolorem voluptatem nihil eveniet dolorem cum dignissimos beatae doloremque qui officia quia in voluptates qui tempora autem quae asperiores tempore eveniet a quis iusto dolor voluptates sit natus alias dicta ad sit unde natus placeat quas possimus nihil sed odit officiis voluptates et aut et culpa reiciendis labore qui aperiam minus beatae voluptas nemo neque molestias omnis dolor ut a nulla consequatur nostrum autem velit quo ipsa praesentium voluptatibus aliquid dolor eveniet eligendi illum animi esse alias neque officia quis doloremque et minus autem consectetur qui est ratione laborum voluptatem sunt est quia voluptas voluptatem porro adipisci nam ut sunt voluptate neque similique earum fuga alias.', '0', '2017-05-02 22:59:00', '2017-05-02 22:59:00');
INSERT INTO `course_news` VALUES ('272', '9', 'Repudiandae veritatis veniam libero tempora voluptas quidem.', 'Repellat fugiat ducimus enim sit dignissimos omnis veritatis hic quas quidem repudiandae nobis error ut aspernatur optio adipisci cumque animi sunt nobis et beatae aut qui maiores quidem cupiditate est at totam ex voluptatem at rem odio et doloremque quia dolore quis odio sint excepturi magni atque praesentium tenetur nisi repellat consequatur dolor rem esse nihil voluptatem officia aut veritatis vel aperiam voluptas accusamus et autem vitae corporis eveniet perspiciatis omnis reprehenderit recusandae corporis dolore doloremque delectus dolores rerum magni neque ut hic molestias et optio sapiente id non quia ullam at possimus ut ut omnis nisi possimus fugiat dignissimos dolor enim suscipit vero non ducimus rem amet repellat occaecati suscipit qui aut tempore ratione aliquid sunt rerum sit odit eligendi harum aut aliquid itaque facilis et in sed itaque ipsam culpa impedit voluptate ut vero autem dolores voluptas nostrum nemo est ipsum facilis quis sunt et ut officia autem aperiam ducimus eligendi eaque ducimus natus dolorem vitae qui dolor nobis ducimus doloribus quo pariatur et ullam soluta eaque quo voluptatem vel minus maxime laborum ea magni ducimus fuga ratione deserunt iure maiores nesciunt ea ut ipsa fuga ut placeat sed ipsa velit harum eligendi dolor incidunt illum ex aliquam dolorem molestias recusandae magnam unde.', '1', '2017-05-02 22:59:00', '2017-05-02 22:59:00');
INSERT INTO `course_news` VALUES ('273', '8', 'Et nesciunt corrupti ut consequatur aut architecto saepe voluptatem.', 'Occaecati ut eaque sunt maiores incidunt ducimus est explicabo eveniet unde iusto eligendi dolorum deserunt omnis facilis sequi enim aut consequuntur aut sit et illo velit eum molestiae earum voluptas adipisci ea cumque assumenda sed non ad aut repudiandae impedit qui quidem non aut harum laboriosam rerum similique voluptatem et animi qui doloribus non repudiandae enim doloribus sed non illo voluptatem enim pariatur sit consectetur neque quae distinctio dolorum ut et molestiae eos quasi illo molestiae dolorem pariatur eos qui et inventore soluta consequatur consectetur consequatur voluptatibus fugit iure at quae et sit ut earum voluptatem omnis non nihil voluptas doloremque aut et ut impedit voluptatem optio quia a nesciunt molestiae natus numquam dolorem dolorem dolores adipisci dolor sint impedit id aliquam numquam laborum sit voluptatem saepe tenetur odit quia maiores quos sit quas aut laudantium molestiae dolorem beatae necessitatibus temporibus id qui id atque necessitatibus quaerat sint sint vitae earum necessitatibus accusamus reiciendis accusantium voluptatem aut voluptas aut cum ut dicta ullam recusandae nam eos aliquam repellat qui atque maiores quidem aliquid commodi eaque numquam nesciunt dicta quaerat consectetur ipsum eligendi ut asperiores aut deserunt deserunt quae soluta alias vero laborum rerum odio nisi veniam voluptatibus et ex iure amet et qui inventore ut voluptatem quia quas vel ullam est non odit id vel placeat ad hic perspiciatis doloribus voluptas aut at aut error natus sed deserunt est illum ut in aut sit saepe quis ea ratione aut id fugiat at est ut qui et voluptas qui deleniti quo dolor eos modi veritatis reprehenderit deserunt placeat labore velit dolorem exercitationem sed omnis iste iste quas iusto non id consequatur minus nobis sequi qui adipisci laboriosam dolores ut est autem voluptatibus rerum commodi eaque verita