INSERT INTO `course_news` VALUES ('274', '10', 'Aperiam tempora perferendis dolorem et possimus.', 'Quas nostrum asperiores ipsa quia omnis et deleniti ad sint voluptas culpa hic ipsam expedita velit pariatur rerum est sapiente tempore doloremque quae doloremque aut molestiae tenetur nisi fugiat nisi animi enim excepturi molestiae non quos ut similique accusantium explicabo id rem enim et aut nisi alias voluptatem sit fugit sit soluta exercitationem temporibus amet beatae dolorum et excepturi dolorum rem fugiat est sit neque sed quaerat assumenda tenetur aperiam voluptatibus dolorem tenetur tempora consectetur molestiae alias eaque dignissimos nemo voluptatem et eum ea illo et voluptatem non ea cum eius cupiditate quisquam velit fuga blanditiis omnis possimus officia facilis impedit architecto necessitatibus totam alias porro vitae reprehenderit et nulla eius laudantium velit libero corrupti voluptas voluptatem maxime et sit inventore praesentium iusto sapiente quia est rerum aut labore non ex consequatur molestiae reiciendis rem delectus sit deleniti totam dolores illo voluptatem perferendis itaque saepe omnis qui perferendis natus harum occaecati ad esse explicabo ipsum quo laborum ipsam illum sapiente officia voluptate hic delectus et ratione quia quo et ea voluptas fugiat dolor mollitia est voluptatem velit debitis porro qui repudiandae sequi eos velit voluptates sed inventore non recusandae qui accusantium fuga et ut et voluptates ipsam maiores omnis ipsum ea aut impedit illum repudiandae ut ipsum placeat ipsum necessitatibus ad consequatur assumenda quia odio ad nesciunt est facere facere minima sed voluptas doloribus voluptas voluptate voluptatum omnis eum vero quisquam esse autem itaque quibusdam asperiores architecto cupiditate tempora dolorem sit.', '1', '2017-05-02 22:59:00', '2017-05-02 22:59:00');
