INSERT INTO `course_news` VALUES ('276', '8', 'Pariatur pariatur dicta perferendis fugiat aliquid dolorem.', 'Animi reprehenderit sapiente id quidem praesentium veniam quod quas rerum aut in consequatur quo doloribus amet error rerum dolorum qui id quas et dolor officia ullam voluptatibus eveniet asperiores quod odio molestias explicabo debitis et fugit eaque aut unde et quia voluptas temporibus sunt voluptate aut aperiam saepe unde ea velit et fugit reiciendis fugiat eveniet ut exercitationem sit fugiat voluptate sed cumque ut sed alias placeat veniam suscipit vero sed et enim quaerat aliquid rerum vel tenetur dolorum consequatur perspiciatis odio distinctio adipisci eos ea sapiente deserunt ex fugiat fugit quod dolores non dolor numquam blanditiis pariatur consequatur non ut vero quia occaecati iure alias in iste dolorem non consectetur iure ullam quia voluptatem et rerum dicta tempora et culpa architecto totam quasi beatae dicta sed ut exercitationem quia incidunt consequuntur officia vero vero quis voluptatem consequatur eos iste quo id et sed dolor debitis at earum facere et eum et ut explicabo repellendus iure quasi est vitae alias ea eaque aliquid minima doloremque quia dolores molestias maxime placeat quod quam iusto eaque ipsum qui adipisci quia quis rerum iure ullam vitae praesentium iure earum labore velit eligendi voluptatem debitis ea molestias sed eum ut fugit rerum in aut adipisci voluptate quisquam unde cum tempora et omnis doloremque quasi eum est recusandae ullam eaque placeat at dolor omnis aperiam incidunt ut dolore dicta adipisci rerum hic vel et veniam impedit odio culpa commodi eum ex rerum a temporibus sapiente molestias officiis velit aspernatur et exercitationem laudantium ut ducimus qui placeat ea est exercitationem nihil cupiditate illo culpa sunt magnam fugiat possimus et ut perferendis tempora hic laboriosam voluptatem quasi rerum molestiae eius temporibus aut repellendus beatae possimus aspernatur sint quia incidunt atque ea nihil temp