INSERT INTO `course_news` VALUES ('277', '6', 'In assumenda ut quia aspernatur.', 'Consectetur quo dolor sit unde corporis consequatur necessitatibus eum ad rerum ducimus et inventore neque nihil in placeat qui mollitia ut non consequuntur sed enim facere eum ut dolorem omnis temporibus officia est laudantium non soluta reprehenderit voluptates asperiores quisquam facere laborum aperiam et voluptatem est quo harum in exercitationem minus repudiandae optio nemo voluptatem voluptate ut atque in et et quam similique quod quia cum non ad facere corrupti est deserunt in recusandae distinctio laudantium ut aut voluptatem placeat tenetur officia ut et error labore sit in magni corrupti accusantium velit aut optio quis quam incidunt quia inventore sit omnis enim qui aliquid explicabo veniam dolore laborum iure harum est repudiandae expedita nemo amet sed rem consequatur sed culpa quis nesciunt amet labore doloribus cupiditate illum aliquam ipsa officia sunt odio fuga et labore ex reprehenderit omnis qui consequatur ea placeat quo incidunt commodi error occaecati eaque qui corrupti doloremque ut impedit non nam repudiandae ut qui ut impedit soluta dolorem quidem inventore deserunt ut dolore ut reprehenderit dolor illo ipsum cumque asperiores non dignissimos quis qui deleniti amet dolor debitis quia et est omnis soluta dolore a exercitationem voluptatibus ipsa totam rerum et possimus aut aperiam necessitatibus aliquid rerum voluptatem voluptas mollitia sed necessitatibus maiores culpa occaecati sapiente vero occaecati reprehenderit et est minus earum enim voluptate fugiat aspernatur veritatis tempora vel cupiditate autem id neque incidunt facilis ex ut nemo voluptatum modi dicta possimus est est unde voluptates repellendus est reprehenderit necessitatibus qui deserunt dolorem sequi possimus esse laboriosam vero sit aperiam occaecati ut at corrupti in ut in soluta et natus illo quod repudiandae maiores qui quia sed qui autem totam ipsum autem vel ipsa enim minima inventore cum