INSERT INTO `course_news` VALUES ('278', '6', 'Facilis aut non et amet.', 'Dolore ipsa rerum nobis quo at ea sequi dicta rem porro nemo maxime in eos nihil quos itaque qui architecto ut sapiente ipsum ipsa et aut consequatur debitis consequuntur minima nobis omnis quisquam amet eius perferendis deleniti commodi deleniti quas commodi earum eaque architecto quia eum rerum et eum eaque eaque sint minus rerum iure sapiente animi maiores sit quae nemo nostrum nisi eos et repudiandae impedit aut corporis perspiciatis vel dolores provident dolore quia tenetur quia maiores expedita voluptatum nemo vitae quod commodi consequatur est minima odit in error qui minima rerum qui tempora aliquid sunt magnam maiores eos et sit id ut nisi aliquam ipsa et ut quam voluptate non veniam quae blanditiis aliquid ut harum pariatur voluptatem et dolore eos exercitationem velit tempora sequi ea ad id iste et et labore maxime odio iusto provident maiores laudantium id sunt saepe odit beatae iste tempore dignissimos sint facilis enim impedit blanditiis laboriosam ullam distinctio quibusdam sit ea magnam id id eligendi molestiae quia nobis consequuntur asperiores qui et consequatur sint mollitia aut fugit id ad ad nihil soluta dolor ut iusto inventore voluptatibus consequatur officia inventore illum minus ut consequuntur culpa veniam veritatis delectus itaque maxime totam nulla et eum dolores qui dolores possimus reiciendis id voluptatibus est est adipisci fuga quod debitis quia assumenda quas dolor ratione aut quasi mollitia et inventore possimus ea quaerat magnam velit perferendis molestiae.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('279', '1', 'Nostrum enim qui ut ea itaque beatae.', 'Nostrum ducimus at autem quae iusto non repellendus enim veniam quia ea modi tenetur ex totam quia dolores sapiente molestias dolorem et nam omnis vitae et soluta aut quisquam ut eius hic aspernatur ipsam ratione et aut incidunt magnam ut maiores quaerat deleniti culpa sint ab culpa possimus nihil qui sunt quos amet suscipit voluptatem incidunt aperiam voluptatibus sed quas vitae sunt rerum dolor quo quia optio ipsa veritatis fuga delectus delectus id tenetur porro eveniet id vel beatae quasi repellat magnam numquam ut esse autem reprehenderit veritatis ut veritatis alias optio laudantium est assumenda earum officiis perferendis ut ut nobis nesciunt aut hic eligendi dignissimos magni qui sit natus ab asperiores aliquid dolor iusto commodi cumque a quia unde consectetur officia ducimus facilis non id rerum assumenda doloribus sint dolores quis exercitationem occaecati magnam natus repellat omnis rem in quibusdam quaerat velit corrupti rerum ut et minus ab dicta natus voluptatem nam eum optio magni esse culpa occaecati nihil et at expedita ad eum velit nihil voluptas et deleniti nesciunt ut quos at cupiditate aspernatur saepe quis asperiores minima nihil tenetur omnis amet adipisci laborum harum nostrum quas voluptatem voluptatibus necessitatibus quod voluptatibus adipisci et velit deserunt eum natus accusamus omnis ipsam rerum numquam odio cupiditate corporis eligendi quae at.', '0', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('280', '4', 'Harum deserunt vero culpa architecto eveniet ratione.', 'Nihil omnis fuga corporis assumenda ipsa a voluptate libero et similique consectetur nobis ut molestias officia sint placeat et nam quasi dolor nihil rerum maxime aut unde aut voluptatem sed possimus sit velit asperiores omnis autem necessitatibus dolorem eos quidem natus odio nam sed cupiditate tenetur omnis aut fugit molestias sed consequatur illum at nisi tenetur id aliquid et molestias et enim ut laboriosam aut voluptas adipisci non maiores voluptatem quasi aut exercitationem ut velit sint et minus eum cumque porro totam dolorum ut minima dolorem voluptas laudantium praesentium cum voluptate labore autem optio et qui molestiae error ea consequatur rerum eum rerum occaecati id debitis similique quia sed et sint sit totam dolor iusto ipsam adipisci inventore at qui laudantium sit aliquid at magnam voluptates voluptas accusamus qui aliquid soluta est tempore consequatur aspernatur delectus tenetur quae odit doloribus recusandae officia dolore commodi corrupti sint minus laboriosam fugit est non animi dolores omnis ad enim non voluptates illo distinctio modi assumenda quam doloribus laboriosam voluptatem neque dolore atque autem illo laborum provident aut nemo tempora a qui molestiae sunt sed temporibus iure quia inventore deleniti a alias enim sed necessitatibus deserunt eum aut neque quas sunt tempore officia dignissimos dolorum excepturi itaque ipsa dolores ex incidunt soluta possimus unde at vitae et quod omnis ut laudantium quis sunt laborum libero sint autem facilis consequatur et quasi aliquid saepe eius officiis adipisci temporibus et et suscipit consequatur et tenetur enim officiis ad ducimus earum sit mollitia eius et incidunt non at nisi dolore et excepturi blanditiis aliquam qui odit amet possimus at expedita aperiam et error incidunt quos quis consequatur sed at cupiditate tenetur inventore error ut sunt et doloremque rerum consequatur accusantium ita