INSERT INTO `course_news` VALUES ('281', '4', 'Maxime nihil quos saepe cum quidem voluptas.', 'Quod assumenda veniam nesciunt asperiores corporis error corporis nostrum qui voluptatem dolor deserunt placeat reprehenderit dolores quibusdam libero enim vel laborum et et est non maxime in reiciendis sapiente ducimus aut voluptatem cum est odio qui fuga inventore temporibus perspiciatis voluptates a corporis quos in quam voluptatem aliquid deleniti cupiditate commodi aut iusto et veniam praesentium corporis nemo perspiciatis sit neque in facere sed et magnam nemo cumque maxime laudantium sequi ut placeat est accusantium omnis porro sed veritatis exercitationem pariatur qui aut eos perferendis est soluta ducimus debitis doloribus repudiandae voluptatibus architecto exercitationem necessitatibus vel animi totam quis corrupti quam nam alias consectetur omnis doloribus minus in qui nostrum quam ipsum laudantium perferendis aut non suscipit consequatur voluptatem rerum est incidunt numquam deserunt sapiente ut iste sint ratione eaque nisi voluptas ipsam quos aut culpa consequatur at non occaecati qui non porro dolor fugiat occaecati dolorum sapiente quasi cumque alias consequuntur molestiae doloribus harum et molestiae vero voluptates saepe cumque quidem non voluptatum repellat laudantium aut maiores nam adipisci sequi tempora iusto eaque natus soluta dolorem omnis optio omnis rerum cum eos consequatur aut sed in necessitatibus omnis placeat error laudantium reiciendis perspiciatis eaque sit et vitae distinctio quia voluptatibus quo inventore qui iure blanditiis non accusantium sed delectus ex nemo autem et nihil natus iste ea modi molestiae perferendis voluptas eveniet reprehenderit vitae non eos natus rerum quia alias praesentium qui quisquam quas ut consectetur eveniet ipsa error perferendis autem qui labore eligendi alias magnam voluptate necessitatibus quod voluptate iste placeat impedit et ducimus voluptas amet ipsum quos labore voluptas iste sed exercitationem aut architecto ad excepturi at porro esse autem laudantium iste dolores perspiciatis iusto ipsa voluptatibus adipisci et non voluptate accusantium adipisci autem deserunt sint.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('282', '3', 'Repudiandae iure velit et nostrum pariatur vitae recusandae dolor.', 'Sed officia eum illo quia natus consectetur minima eveniet dicta animi reiciendis quis sunt consequatur commodi totam velit rem ut et et qui non a quia omnis qui delectus voluptatem et ab expedita sint qui provident repellat et veritatis quam beatae itaque vel laborum laudantium corporis repudiandae mollitia neque laborum facere saepe velit dolore delectus occaecati repellendus autem consectetur nemo ipsa recusandae quisquam magnam nihil eos dolores in corrupti asperiores harum nam repellat accusamus cumque libero distinctio qui eveniet quam non atque enim modi et blanditiis qui ipsam magni eum eum animi quia sequi ipsum voluptates velit sint sapiente hic ipsa autem perferendis tempore minus aliquam magni ducimus eaque qui totam deleniti perspiciatis vel sit earum ipsam exercitationem enim iusto ea voluptatem amet rem odio et qui atque accusantium ut deserunt est voluptates beatae aut reprehenderit quos atque doloribus sit sint voluptate vitae et qui veniam alias beatae qui ipsam soluta et magni rerum iusto consectetur non illum dolorum et vel qui laudantium ipsam doloremque doloremque nesciunt modi maiores inventore nihil impedit sint natus et mollitia et eos eligendi veniam eligendi et eligendi rerum earum molestias illo quas dolores laborum exercitationem et ea eum enim magnam doloremque soluta et rerum et aliquid voluptates voluptatibus quaerat labore debitis velit enim dolore accusamus et ratione blanditiis nihil nihil aut blanditiis modi et reiciendis dolorem quaerat et rerum est quidem aut velit qui eius ipsa tempora soluta alias minus quia adipisci aut dolorem cupiditate aut reprehenderit in eos et hic in nihil assumenda nostrum sequi quia aut ut sint aliquid magnam necessitatibus corrupti nesciunt dolorem ut sed cum maiores voluptas quia consequatur a sint facilis nulla a facere doloremque ex unde vero id error aut qui expedita dolor voluptatum est corporis dolore est totam eius recusandae accusamus qui qui dolore eum numquam debitis aut eius beatae occaecati odio laudantium assumenda dolores consectetur voluptas ea consequuntur totam earum velit temporibus fugiat ut ipsam cumque dolore vel voluptatibus quidem ipsa est nihil quasi quasi rerum ut sapiente quia vitae commodi eos sunt dolorem illo quis veritatis atque ea nam odio et.', '0', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('283', '5', 'Alias sint qui culpa quia.', 'Corrupti ducimus reiciendis sed fuga exercitationem iure sunt eum tempore et facilis est sunt iste repudiandae rerum ullam ipsum et ratione consequatur qui qui nostrum incidunt fugit laboriosam facere fuga voluptatem aliquam saepe sapiente totam at quis aut nulla distinctio eos ipsa quo est eius amet ut eos recusandae harum aut repellendus aut dicta iusto eveniet praesentium placeat alias perspiciatis eveniet excepturi repellat debitis doloribus fugiat qui quam qui temporibus laudantium earum quos suscipit est tempora quaerat perspiciatis expedita commodi laudantium blanditiis dolorem reiciendis debitis porro officiis dolores voluptatem quod quas saepe qui laudantium iusto aut nobis ut autem iste doloremque labore sit asperiores natus facere aut similique minus officia reprehenderit non fugit est sunt velit magnam delectus numquam ut commodi et eaque praesentium soluta quisquam dicta et soluta in officia exercitationem veniam facere et ipsum voluptatibus magnam id porro perferendis consequatur qui dolores quis mollitia et eos deleniti consequatur culpa ab praesentium incidunt voluptates et laboriosam pariatur excepturi reprehenderit enim qui in aut ut voluptatibus modi nulla voluptas nam aut qui ipsum repellat culpa eaque eum accusamus velit neque qui culpa atque expedita at vel optio saepe consequatur in quia quo consectetur commodi reiciendis perspiciatis dolorem incidunt molestiae ut quia voluptatum qui sint ipsa soluta voluptatum aut quae cumque dolorem modi voluptatum vitae in dolores sint officiis libero est in ut perferendis in distinctio deserunt recusandae labore non vel aut officia eius tenetur sequi vero enim illum rem quod saepe.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('284', '10', 'Nisi reprehenderit corporis at nemo in.', 'Saepe nihil ab enim dolores animi repellendus est sunt amet qui reiciendis a amet delectus et error ratione vel aperiam sunt voluptas esse nam natus fugit eum quaerat rerum vel assumenda ipsa eos ducimus facere quia non voluptatem ipsum suscipit ut quae soluta beatae impedit sed quasi consequatur ducimus commodi dolor non magnam maiores nisi cumque quae qui repellendus autem tenetur aut sapiente atque saepe aliquam et ut reprehenderit illo libero culpa debitis et et rerum non facilis cumque quae hic aut omnis animi dolorem architecto delectus dolorem qui occaecati alias explicabo asperiores voluptatem voluptatibus rerum nisi debitis alias est reprehenderit repellat nesciunt ea aut itaque enim molestiae sed nam non qui non temporibus quae voluptas tempora tenetur magni nobis hic maxime quia facere blanditiis atque ut nam laboriosam necessitatibus eos excepturi rerum quae atque voluptas aliquam et et deleniti non debitis ut sunt autem delectus eius qui sit corporis voluptatem voluptas veritatis qui maiores quos dolorem quidem necessitatibus illo quidem ducimus aut amet impedit iusto id dolores et aliquam ut tempora labore odio est accusamus ipsum dolorum ex unde inventore qui voluptatem commodi est ut incidunt quo mollitia vel est neque in incidunt odio repellat.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('285', '7', 'Dignissimos facilis officiis beatae necessitatibus aut maxime.', 'Quas exercitationem modi sunt fuga deleniti est voluptas aut enim id unde fugit et dolorem aut consequuntur quas alias fuga quia totam magni magni magni sit corporis sed est deserunt aliquam non voluptas culpa ullam reiciendis est similique ipsa culpa et voluptatibus ab voluptate quo nihil eos voluptas velit rerum sed ut unde mollitia corporis quia nihil dolorem rerum omnis earum ducimus quod suscipit cum velit voluptatibus et nihil saepe ut totam non sunt ratione ut molestiae sint enim ipsam nobis quidem quaerat aut ratione quia et eaque sapiente assumenda distinctio possimus dolorem nemo quod id vel ut qui qui dolores aliquam debitis ipsum voluptatem sed qui velit quia provident odio totam tempora ea qui consectetur qui similique quisquam explicabo vitae neque eum minima minus enim explicabo sunt tempora architecto quas molestiae soluta architecto qui quas non rerum corrupti nemo ex perferendis enim incidunt aut consequuntur officia est repellendus pariatur qui numquam animi voluptatem ut et consequatur aliquid et quia nam delectus cupiditate qui explicabo aut reprehenderit nisi reprehenderit aspernatur sunt rem corporis dolore qui ut illum ut harum adipisci incidunt ea non sunt maxime id consequuntur reiciendis dolores fugiat omnis quia doloribus voluptatem temporibus consequatur culpa et et doloremque veniam fugit dolore deleniti sunt maiores autem corporis atque modi dolores deleniti esse quaerat atque autem nobis.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('286', '2', 'Et temporibus qui quo accusantium iste.', 'Quibusdam quia velit excepturi neque ullam et aut officia repellendus et et rerum sit praesentium eum delectus ducimus voluptas et ad quia enim molestiae eos et ut maxime aperiam expedita consequuntur occaecati dolor facere quia autem soluta officia et in mollitia laborum autem perferendis doloremque qui hic itaque nesciunt possimus error veritatis sunt deserunt rerum est iste et aspernatur doloremque ipsam ut hic quis voluptatem dolorem animi occaecati nam praesentium alias qui repellendus sit facilis et totam optio quia aut eligendi quod voluptatem sunt nihil architecto voluptatibus ratione sed sit placeat et ratione distinctio occaecati beatae eum repudiandae natus voluptas optio et et tempora deleniti rem omnis sapiente delectus ut unde debitis cum ut quidem facere incidunt accusantium modi quis saepe optio voluptatem aut consequatur sint dolor laboriosam id iusto aspernatur molestias maiores in est expedita voluptate sapiente saepe eveniet aut a non accusamus aut quasi est quis in rerum tempora sed quaerat iure explicabo cupiditate id sint expedita praesentium aut impedit accusantium harum quos vel quasi perspiciatis fugit et laborum dolor cupiditate qui dicta vitae dolor aut itaque sit dolorem et est aut et quis accusamus id veniam repellat tempora atque excepturi eos esse impedit dolores omnis ratione voluptatibus delectus quis blanditiis non quia est aut facere placeat sint hic nemo officia est saepe sed fugit quae adipisci et quaerat consequuntur voluptatem est similique ut velit sunt laborum cumque sit nisi voluptas consequatur dolores eos maxime id repellendus doloremque assumenda est voluptatum maiores amet labore delectus similique perferendis et quia quo praesentium quis quidem magni unde ab saepe et magni sequi sint voluptatibus aut error ducimus beatae ut quia iste molestiae est asperiores doloribus pariatur doloremque et reiciendis est consectetur a a et quia et blanditiis deserunt ea magnam sint pariatur numquam recusandae doloremque voluptas quis quia minima est magnam qui laboriosam at nulla est illo ratione perspiciatis harum in eius minus dolorum voluptas hic quae quas quae laudantium similique eligendi voluptatem illum repudiandae debitis deleniti consectetur iusto explicabo porro sunt atque omnis est sunt dolore quae doloribus laborum debitis provident officiis non voluptatem deleniti dolor alias ut eligendi in nisi eius ipsam suscipit ab voluptate quo magnam dolor aut.', '0', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('287', '6', 'Quia omnis magnam sit praesentium voluptas consequatur.', 'Rem maiores aspernatur dolor praesentium veniam vero ut dicta ipsa soluta a natus est itaque debitis magni accusantium et voluptas est laudantium odit modi excepturi quae asperiores facilis illo sit et et aut itaque est iure ipsam repudiandae aperiam laudantium aut ullam eligendi nostrum nulla minima dolorum nihil et et saepe et voluptates qui rerum et ea numquam inventore ipsa alias consectetur et sunt nostrum eaque aut possimus illo asperiores enim et odio dolor et quia et culpa ipsum quod esse illo dolores aut laboriosam dolor similique et et assumenda distinctio minus dolore nostrum occaecati cum vitae ut ad magni praesentium veritatis aut aut aspernatur aliquid et est mollitia id qui excepturi consequatur impedit nobis quas reprehenderit voluptas ullam tempore nihil ad id iste dicta est eum distinctio est laboriosam consequuntur pariatur molestiae corporis libero inventore veritatis voluptate sequi numquam qui non molestias quia nihil aut et facilis enim aliquid quas nihil quis ipsam voluptas quas iusto ut recusandae qui architecto repellat quia minima et dignissimos impedit sunt rerum expedita tempore aut eum nisi unde aut tempora repellat aliquid aliquid tempora dolorem consequatur dolorum possimus corrupti eaque debitis autem exercitationem fugiat ipsum incidunt in aspernatur aspernatur eius aut doloribus voluptates in et officia nemo veniam dolores id non pariatur praesentium dignissimos occaecati doloribus ipsam laboriosam quia ut quis nam voluptate amet natus voluptas reprehenderit impedit ipsam laborum ut porro illum fuga sint minus libero sunt et ea illum in ipsam ut explicabo placeat et eum sequi rerum dolores aliquid molestiae non eius quia quia velit doloribus numquam ut id aut voluptates accusamus suscipit laboriosam vel corrupti nesciunt aliquid sequi animi velit non rerum facilis omnis excepturi cumque tempore veritatis accusantium ipsa eligendi qui ut doloribus repudiandae et debitis iusto quae quam eveniet aperiam possimus ut aut placeat voluptatem necessitatibus quasi dolorum et nihil ipsum vitae asperiores quia et occaecati aspernatur placeat sunt officiis ut molestiae quo autem aspernatur accusamus et dolor nam sunt molestiae fugit animi error non architecto dolorem aut voluptatum eligendi velit ab numquam voluptatem.', '0', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('288', '8', 'Omnis officiis inventore quo voluptates.', 'Impedit quibusdam quis quaerat vitae consequatur dolores vel at inventore optio sint ut porro eaque animi dolores voluptatibus enim vel ea officia et illum tempore deleniti deserunt eum aut libero et vel dolor ullam explicabo voluptas rerum quaerat et et adipisci commodi tenetur amet dolor eveniet iusto autem et quaerat animi omnis et possimus facere consequatur dolor vero quam vero ipsum iste itaque et deleniti possimus reiciendis veritatis commodi velit et iure perferendis ut sit non quas ea nisi aut omnis dolor quis ducimus sit consequatur quibusdam necessitatibus aut rerum aliquid exercitationem mollitia ipsam porro qui id architecto odit non suscipit aut iusto repellat repellat inventore ratione iusto sed est maiores veniam magni vitae quam sequi quaerat quia dolores sed architecto cumque iste magni ut neque ex rerum est nesciunt eos et repudiandae quis nobis est iste fugiat consequuntur et quia ut dolorem dolorem minus natus sint expedita cumque voluptas ipsa sapiente laudantium sunt voluptatum quae qui fuga quasi quia voluptas voluptates et sunt et odit cum iusto fugiat quia eum quibusdam praesentium quas magnam odio consequatur pariatur optio maxime aut enim alias similique aliquid voluptatibus et sed consequatur cumque repellendus amet vel neque harum perspiciatis ipsa corporis optio dignissimos vitae labore eligendi sit beatae.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('289', '5', 'Sed harum autem similique eum totam voluptatem animi nihil.', 'Sapiente rerum accusantium voluptates velit magnam aut rerum est autem eveniet aut exercitationem nihil facilis voluptatem alias consectetur minus ut dolorem inventore harum deserunt voluptatem sunt et illo quia aut at autem aut quaerat fugiat aut quo animi mollitia numquam a quibusdam sunt amet dolores quia id amet et et ea omnis et ullam et sit enim voluptatum sit sed numquam rerum dolorem cumque ab cupiditate aperiam architecto voluptatibus iste eum accusamus exercitationem veritatis eos delectus velit harum numquam deleniti esse velit porro sequi excepturi sed fugit repudiandae saepe sunt maxime et qui quam vero magni illum reiciendis quis qui ut magni dolorem nostrum aut consequatur quo neque et voluptatum natus nostrum nulla officia sapiente culpa esse quidem consectetur reprehenderit tempore nihil incidunt ea error quo ex maiores quis exercitationem aut aliquam quam corporis similique corrupti repudiandae officia blanditiis animi dolores reprehenderit rerum quis magnam laudantium tempora omnis quod veritatis velit laboriosam dicta eaque laudantium ut excepturi ut adipisci quas dolor non perspiciatis est est qui nostrum sunt exercitationem ullam quia repudiandae ullam quod quas perspiciatis sint illo et distinctio est et rerum iusto dolor inventore neque dolorem tempore animi perspiciatis quia officia doloribus autem a nihil consequatur qui maiores dignissimos nesciunt voluptatem ut hic quasi numquam et sequi harum qui dolor blanditiis iure tempora deleniti tenetur.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('290', '10', 'Voluptatem praesentium sint recusandae quo.', 'Consectetur omnis molestias repellat sit labore dolorem quo qui nobis quo et ipsa officiis quis aut maxime excepturi sequi doloribus a occaecati sint rerum et tenetur consequuntur totam corrupti quos et deserunt incidunt aliquam dicta in iure et ut optio consequatur saepe ea odit dolore soluta in odio cum similique tempora voluptatem id eos eum officiis nulla nobis quos eum totam illo et enim molestias quas possimus sunt ut porro nesciunt rem id vitae non et veniam beatae possimus tenetur ratione dolorum est et inventore consectetur velit possimus animi qui vitae temporibus recusandae sit totam ut laborum aut ipsum odit qui illo mollitia ex quo beatae et molestiae voluptatem omnis quis reprehenderit et quis ut harum pariatur totam sed molestiae voluptatem excepturi accusantium optio rerum quis assumenda nostrum ea inventore illo ducimus et deleniti error velit ea et officiis numquam asperiores non est rem quasi odit dolorem reiciendis fugit temporibus corporis veritatis voluptas explicabo numquam quidem et eius consequatur vitae minima culpa doloribus fugiat sequi alias est magnam ea iure ut eum qui nisi impedit et praesentium esse placeat debitis non libero sunt qui et amet magnam consequatur praesentium doloremque officia nobis sint quidem natus voluptatem deserunt repellendus excepturi ullam aliquid aut laborum dignissimos similique aspernatur officiis ipsam ut quaerat laborum corporis numquam impedit est nobis et quaerat et voluptates libero illo aut cumque impedit ut sint maxime pariatur nam ut nemo et repellendus nobis placeat consequatur maiores expedita error voluptatem non a laudantium quibusdam dolorum et fugiat quis tempore aut tenetur corrupti laudantium velit aut sed maxime est autem et nisi ullam et dolor nihil culpa porro quisquam mollitia eos eius eligendi quasi dolorum aliquid eveniet placeat eligendi animi aperiam itaque pariatur aperiam fuga et id adipisci molestiae quia id ipsum illo nobis doloremque praesentium ullam ducimus tempore cumque sed eos dolorem asperiores laudantium quo adipisci itaque architecto corporis iure quo ratione ut nisi delectus qui sed deserunt id aut voluptas iste numquam officia qui repudiandae qui quaerat voluptas ut labore aliquam ducimus magnam est odio dolores amet officia omnis perspiciatis exercitationem assumenda autem soluta dolor id quaerat est soluta earum voluptatem aperiam vitae doloribus sunt sunt dolorum nobis repellendus dolorem rerum similique consequatur voluptas qui pariatur rerum est dolorem et consequatur voluptatem possimus ipsum architecto qui voluptatem est earum id tenetur itaque excepturi nulla dolor rerum.', '0', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('291', '9', 'Est aut nihil et dolores quis.', 'Dicta vitae et perferendis maiores natus officia nesciunt in aut aut maxime consequatur quae dolores error porro molestiae expedita dolorem nulla cupiditate cumque quo dolorem et vitae necessitatibus sed accusantium aut reiciendis quidem recusandae qui nulla dicta nesciunt illum at nihil ut aut at perferendis aspernatur sed et vitae quod suscipit laborum ut perspiciatis sit quae voluptate nesciunt aliquid et et qui et assumenda vel consequatur dolorem enim optio temporibus et repellat voluptate cupiditate et magnam natus dignissimos id ut et quisquam maxime quo illum omnis sed occaecati dolores voluptatem deleniti eum doloremque provident et nesciunt sunt quas eos omnis ducimus aut vel quos autem et enim ea rerum voluptatem expedita rerum optio ad nesciunt commodi quis unde odit praesentium ipsum accusantium rerum alias deserunt libero voluptatum minus impedit aut omnis et sit quisquam quo itaque natus eveniet et et et nemo inventore alias in natus consequatur rerum architecto ut minus ut enim cum velit repudiandae aut provident dolores sit in ut quam dolore tenetur aperiam sequi quidem molestias vel delectus atque beatae amet molestiae et sunt quaerat facilis ipsam et aperiam enim alias porro eveniet possimus nesciunt cumque deserunt perspiciatis minima facilis accusamus culpa eos tenetur ipsum totam ipsam inventore laudantium vero voluptas quibusdam dolorem aut suscipit doloribus adipisci fugit nulla totam ipsam quos ut sed voluptatem reiciendis iusto eaque porro culpa dolorem fugit laboriosam error consequatur sunt doloremque sit placeat quia culpa quidem rerum recusandae ab dolores sint aut vitae non in consectetur autem repellendus saepe nisi maxime esse repellat ipsam ipsa maxime nemo quia voluptate commodi illo quas omnis error qui eligendi voluptate atque quod quo aperiam recusandae sint ipsum praesentium et vel optio quia enim voluptatem odit id aspernatur est eos repudiandae laudantium perspiciatis velit voluptatem distinctio debitis beatae et deserunt omnis voluptatem animi cumque officiis quaerat suscipit qui sit illo ratione nulla qui voluptatem sit dolore provident et minus alias eaque et enim similique error voluptatum quam ex provident consectetur odio ipsam nihil rerum qui et dolorum ratione at aut voluptatem qui voluptas maiores nesciunt esse quo aut nihil facere a vitae deleniti ipsum temporibus et nihil sequi non dolorem qui aperiam nesciunt aut consectetur autem necessitatibus fugit deserunt non officiis accusantium aut repellat sequi dolor nihil et sit doloribus labore dolorum repellendus reiciendis hic hic in non corrupti voluptate rerum doloribus dolorum ipsa placeat similique blanditiis dolore iure voluptate saepe ut dolorem velit id sint qui sed voluptas hic numquam eaque voluptate beatae est et perspiciatis cumque dolores non.', '0', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('292', '3', 'Hic suscipit aliquid aliquam ratione.', 'Explicabo aut cupiditate illum consequatur magnam dolorem qui maxime sint a sunt et quos tenetur harum occaecati est fugit nihil ut architecto repudiandae dolorem consequatur non et voluptate quia nihil dolorum laudantium enim vel aut doloribus iste aut qui est qui officia similique inventore consectetur accusamus sint ut et incidunt quae omnis aut excepturi unde reprehenderit id aspernatur excepturi culpa eligendi perspiciatis sed illum debitis sunt cumque nesciunt rerum dolorum et quidem porro veniam nesciunt nobis eveniet nemo officiis similique cumque officia aut provident cupiditate mollitia beatae harum minus exercitationem eum sit occaecati eos quasi aliquid consequatur quas exercitationem fugit culpa laborum non omnis commodi nihil quia a mollitia quos est alias aut quia quo corporis et deleniti dolores nihil non fugiat itaque nostrum earum sed voluptas optio deserunt sunt blanditiis pariatur cumque mollitia dolorem sequi fugit itaque est eum necessitatibus hic et qui distinctio quod qui corrupti et autem sed qui est qui delectus est eius voluptatem odit voluptas quas quae aut nemo dolores nesciunt dolore qui maxime quisquam harum quaerat quo in qui at ullam consequatur dolor voluptate doloremque voluptates praesentium voluptatem numquam fugit ut cum fuga minus corrupti libero illo cumque cum quis ut repudiandae omnis quo consequatur ut et nostrum qui odio ea quia ut quaerat sed totam veniam quo tempore officia et est sed iste ex est dolor ut consectetur odio voluptatem esse ipsa quia inventore ut dolor quos ut eveniet consectetur doloribus itaque laborum voluptatem saepe labore rerum numquam ipsam dolores et magni perspiciatis ex assumenda et officiis numquam distinctio eaque at animi facilis sint aperiam labore esse possimus error consequuntur aut odio voluptate illum ut nam velit qui adipisci et doloribus inventore et fugit molestiae reprehenderit molestiae qui omnis exercitationem quo velit veniam iusto ut et numquam sequi iusto sed at rerum dolor esse quae corporis non deleniti maiores explicabo sunt eum vero ipsum libero nam voluptas tempora ipsa in maxime amet voluptatibus eos veniam provident dolor nobis doloribus debitis amet quos sint enim corporis illum reprehenderit et commodi esse beatae minima qui porro sint dolor ut perferendis officia ut exercitationem qui ut et maiores minus mollitia provident dolores est excepturi architecto sunt praesentium odit qui veniam porro suscipit animi consequatur accusantium omnis laboriosam est aperiam modi odio voluptatem placeat harum repellat.', '1', '2017-05-02 22:59:01', '2017-05-02 22:59:01');
INSERT INTO `course_news` VALUES ('293', '8', 'Et sapiente ratione et perferendis sit velit suscipit temporibus.', 'Neque est fugit earum nesciunt ullam dignissimos totam deserunt doloribus ut beatae sit ab quae ut eum cupiditate enim tenetur repellat cumque hic delectus ullam ea ut quibusdam consequuntur eveniet quibusdam dolores tempora iusto eum eos harum tempore sit aut maxime voluptatem quam est enim reiciendis est quia id provident voluptas enim eveniet nobis voluptatibus eligendi at cumque odio enim dicta explicabo accusamus ut ad qui dolorem eum et magni recusandae rem recusandae rerum fuga rerum officiis dolores qui aut ipsa dignissimos voluptatibus illum dolorem maiores et quae est molestiae in occaecati corrupti atque voluptatum a molestiae accusantium qui enim a ratione est qui accusantium deleniti et similique facere aut dolor quibusdam maxime est cupiditate ut incidunt non recusandae enim non adipisci qui recusandae quam adipisci tenetur non ut debitis consequatur est qui quos reiciendis dolore quaerat unde qui voluptas molestiae itaque voluptatum sit iusto omnis natus quia aut rerum recusandae voluptas dolorum laboriosam debitis officia ab placeat veniam fuga eum assumenda voluptatem enim rerum magni et in fugit laborum est nemo sequi quos non id molestiae adipisci dolor hic aut dignissimos eum voluptatibus corporis voluptas atque est quas sed eos debitis neque ipsa quisquam consequatur dolorum cumque placeat aut tenetur iure ipsum optio qui accusantium laudantium consequatur omnis voluptatem quia dicta aut iste qui impedit dolores qui facere maiores illum enim fugiat corrupti commodi est velit totam qui ipsam amet unde est harum harum corrupti et accusantium accusamus iste repellendus commodi sit quibusdam tempora deserunt inventore rem illo non autem fugit voluptas omnis necessitatibus et cupiditate impedit dolor dolores sed mollitia delectus omnis commodi consequatur officiis officia consequatur est non voluptatum voluptatum atque tenetur sed sed e