INSERT INTO `course_news` VALUES ('295', '4', 'Eligendi esse sit dolor sit omnis reiciendis.', 'Fuga nulla recusandae est dicta qui non excepturi at qui optio accusamus quis earum quam eveniet natus ducimus facere autem illo vel iste voluptatibus aspernatur nulla voluptas maxime voluptas sed eos voluptatum praesentium dolores fuga expedita quis mollitia voluptas et eaque veritatis aliquid ab consequatur accusamus reiciendis vel et illum est dolor non tenetur quia mollitia illum natus quaerat sed possimus officia earum non et saepe vitae unde alias et doloribus amet vitae consequatur autem qui vero expedita debitis accusamus inventore error dolorum sequi qui reprehenderit vel accusamus dolore blanditiis consequatur quis molestiae reprehenderit dolor natus fuga quis labore a cum ab et sapiente delectus iste eos illo et a vel iusto voluptas unde magni provident quidem cupiditate quas aut odit consequatur officia magni repellendus asperiores accusantium ipsam possimus qui labore molestiae recusandae error ea iusto error quidem qui expedita laboriosam tempora nemo deserunt odit ad sed nihil laudantium in architecto officiis nam iure et consequatur aliquid provident necessitatibus nostrum voluptatem ut aliquid sunt impedit dignissimos doloribus fugit rerum reiciendis quibusdam ipsum adipisci vel labore unde excepturi unde nihil et voluptates minima illum corrupti exercitationem quia quidem dolorem vel omnis fuga qui ipsam doloribus quaerat dolorem officia voluptate voluptatem numquam numquam aspernatur ut corrupti impedit sit esse aliquid a provident cupiditate sint at est rerum expedita et minus aut est ut voluptas et suscipit dolor et provident perferendis ipsa rerum voluptatem rem illum hic architecto aut labore ipsum odit dolore quo omnis voluptatem quae accusantium corporis quas eligendi quasi soluta non similique quis fuga perspiciatis aspernatur enim voluptatibus dolores expedita officiis blanditiis quia ipsam beatae voluptatem natus et sunt quia cupiditate sed atq