INSERT INTO `course_news` VALUES ('298', '4', 'Sed id porro ut.', 'Cumque vel aut quod est nesciunt quo nobis rerum fugit tenetur exercitationem dolorum eos consectetur consequatur molestias nam fugit placeat debitis eveniet velit cum eum neque laborum fuga deleniti magnam fugit iure doloribus voluptates ut itaque accusamus iure incidunt enim eveniet aut quia nobis laboriosam nostrum consequuntur ea et et et aliquid enim commodi dolorem voluptatibus quis ut earum recusandae alias nostrum quibusdam cumque repellat rem earum necessitatibus totam consequatur sint omnis amet libero et maiores quas dolorum blanditiis porro illum nihil et qui aspernatur aliquam eveniet explicabo molestiae et et ut quam incidunt soluta qui facere facere qui quia eligendi ut numquam dolorem molestias ab qui culpa id sint molestiae corrupti aperiam quasi nulla non dolore quas voluptatem nisi harum molestiae ipsam similique pariatur repellendus consequuntur quia repellat vitae necessitatibus temporibus quo rerum veritatis non facere officia corporis impedit ratione et neque dolorum quia soluta deleniti iusto a voluptate atque illum alias vel voluptatem aut magnam laboriosam quo quia minus aliquid est eveniet vero ab ut dolores ut tempora autem quibusdam cupiditate temporibus numquam soluta quia cum delectus ipsa dolorem exercitationem quo doloremque cumque minima nesciunt sint saepe sit qui saepe quos qui delectus cupiditate asperiores odio magni sunt et libero voluptas doloremque quam blanditiis nostrum est sint ut omnis distinctio quasi molestiae ut qui molestiae impedit facere delectus impedit repellat modi quia deserunt optio et id possimus.', '0', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
