INSERT INTO `course_news` VALUES ('300', '7', 'Maiores doloribus consequatur quo.', 'Ratione veritatis similique harum enim eveniet id consectetur pariatur tenetur libero excepturi maiores natus nam maxime enim eos impedit maxime rerum numquam ipsa dolore quis voluptatem doloribus explicabo porro nesciunt suscipit incidunt at quo debitis sint neque soluta saepe qui laboriosam consequatur nostrum omnis est tenetur officia ea qui placeat qui eum et earum non non consequatur ad sequi impedit occaecati qui eaque harum et iusto tempore eveniet nemo animi dolorem consequuntur aut consequatur pariatur aut qui repellendus voluptas deleniti praesentium dolor nam quasi harum at eligendi est at cum ducimus voluptas libero ipsum eveniet expedita blanditiis sint repudiandae fuga rerum voluptatem sunt quis rerum dolorum sequi optio consequatur blanditiis recusandae doloremque est ipsam temporibus tenetur qui sunt assumenda deleniti non eius amet ad aut ut inventore est molestiae voluptatum voluptatum ducimus exercitationem eveniet magni illo quam ut sed voluptatem omnis quis deserunt architecto iusto corporis deleniti nisi vitae maxime nesciunt ex molestias et et facilis hic aliquid quia aut dolorem sit facere soluta voluptate animi qui eum et vel aut facere neque veniam nihil labore aperiam perspiciatis beatae sit vero et dolores aliquam sunt dolor occaecati voluptate amet animi officia eius distinctio harum molestiae sed dolor voluptatibus dolore voluptas quidem voluptas omnis omnis porro et repellendus incidunt doloribus quia nam ipsam eaque in assumenda velit aliquid veniam aut perferendis non cupiditate eaque non libero dolores repudiandae repellat in et magnam quo officiis voluptatem voluptatem porro sint blanditiis.', '0', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('301', '4', 'Fugiat dolorem qui dolorum voluptas repellat.', 'Alias sapiente amet id rerum illum officiis distinctio nulla qui ipsum assumenda vero omnis consequuntur quia nesciunt quas eligendi assumenda animi autem consequatur ut libero sint facere totam autem praesentium sequi id officia ipsum architecto laudantium minima perferendis fugit non voluptatem impedit incidunt consequuntur esse sed impedit sequi sapiente quisquam aut a quia fuga architecto et omnis nemo porro dolores ea occaecati eum amet ipsa ipsa enim qui asperiores dolor doloremque necessitatibus qui voluptas aut itaque perferendis voluptas et consequatur error suscipit pariatur unde id blanditiis vitae est aut eveniet consequatur eum fugit maxime unde consequuntur officiis ut et qui tempora velit dolores ratione neque aperiam accusamus impedit voluptates laboriosam et facere doloremque quis quasi provident accusantium est et velit consequatur dolorem qui quisquam nihil nostrum eum minus in alias delectus unde unde dolor vel ut sed ut eos vero consequatur exercitationem deserunt voluptatem deleniti in autem accusantium ut minus non et et sit recusandae in minus nihil voluptas eos ut dolore qui quisquam aut voluptates pariatur ut et sed perspiciatis suscipit excepturi aliquam amet pariatur blanditiis aut iure sequi et et veniam non et omnis omnis vero id quia tenetur natus reprehenderit velit optio minus dolorem repellat soluta molestias accusamus quo deserunt et accusantium tenetur ea est fugit fugiat quo fugit quo natus et recusandae impedit quibusdam non hic est beatae laborum esse inventore temporibus nostrum vero pariatur est et vel in omnis eos debitis velit provident facere eum aperiam cumque deserunt provident quibusdam et fugiat accusamus repellat et exercitationem ut eum veritatis reprehenderit inventore facere totam iusto.', '0', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('302', '8', 'Quidem aut doloribus quidem dolore aut aut.', 'Odio est ab qui quia ipsum atque sint quae vel ut amet qui vitae dolore voluptas ut aut voluptatem hic modi in inventore accusantium voluptas maiores nesciunt ut veniam autem nihil et qui quo omnis molestiae numquam error fugit et animi architecto dicta qui repellat et assumenda voluptatum reiciendis beatae omnis neque magnam voluptas sunt blanditiis odio incidunt optio voluptates adipisci et cum eos molestias illo quia eum et tenetur voluptas laudantium consequatur et ipsum aut tenetur distinctio et et accusamus suscipit facere doloribus libero explicabo qui inventore natus fuga dicta impedit earum explicabo incidunt voluptatum vero saepe est velit error ex et quis id ipsa quam totam nemo aut iure corrupti pariatur ut nihil eius pariatur aliquid sint cumque dolore non eum est est dolorem pariatur nesciunt autem quis assumenda quo nihil eligendi perspiciatis et provident vitae tempore beatae voluptates tenetur aspernatur quis quia est exercitationem et explicabo iure neque sit molestias sequi impedit architecto itaque amet modi voluptatem quis illo enim quisquam velit adipisci ea sit magni est saepe modi consectetur laborum eum numquam veniam possimus veritatis recusandae eum sit ea odit sed nulla illo omnis quasi excepturi nulla corporis laudantium perferendis consequatur perferendis voluptatem repudiandae alias unde cupiditate et deserunt quia in totam nobis soluta laudantium illum voluptatum non nam rerum provident et rerum beatae aut et aut natus ut optio at magnam sed voluptate ipsam soluta maiores expedita consequuntur id sit harum voluptas qui consectetur sunt et rerum veniam vitae minima eveniet nisi in recusandae qui autem veniam aliquid quia suscipit est quam tempore iure dolor laboriosam ut et cumque nihil aspernatur laboriosam est harum maxime voluptatem reiciendis consequatur dolorem eligendi aut facere pariatur nihil eum voluptates accusantium minima in est op