INSERT INTO `course_news` VALUES ('303', '3', 'Voluptatem magni qui sed ad.', 'Nemo provident incidunt veritatis dignissimos rerum quis perspiciatis autem ipsa eaque dicta maiores voluptas ut sed repellendus vero sit aut vel sed quam quidem quibusdam veniam rem iure aperiam ut et fugiat iste quibusdam nemo aut facere quidem et rerum eum non quia distinctio necessitatibus animi omnis et aut facere atque nihil voluptas et est facere et occaecati harum maiores aliquid est fugit nesciunt aut cumque perspiciatis optio voluptate velit deserunt debitis nam sed doloribus quis ut fugit mollitia sed omnis autem aut qui eaque sit culpa cumque asperiores maiores a aperiam itaque atque ducimus tenetur dolore quia voluptate nemo delectus amet sunt sit accusamus repellendus omnis suscipit numquam odit deserunt illum fugiat non aut id culpa modi quae in rem in non cumque facilis molestias qui voluptatem nemo quis quam voluptas in recusandae et dolor laudantium rerum cumque deleniti minima eum architecto saepe eos sed molestiae alias voluptas molestiae est hic rerum ratione qui ab quos in non amet quae omnis voluptas aliquam voluptas non praesentium omnis eum quaerat aut eos a nobis ab quis est dolores aut sit ullam ea tempore et quas beatae culpa nihil ipsa quidem omnis voluptatibus quis nulla autem recusandae fuga veritatis enim fugiat dolore et occaecati ea vel.', '0', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('304', '8', 'Ut rem necessitatibus vitae et.', 'Cumque praesentium fuga beatae atque nobis et et eos consequatur eveniet autem consequuntur voluptates unde repudiandae delectus velit nesciunt perferendis enim voluptatem asperiores provident aut accusantium doloremque voluptas quasi distinctio rerum porro eveniet quia natus quisquam cumque nemo quasi porro ad eos tenetur incidunt aut et vel error sapiente maxime velit culpa modi beatae sequi debitis aliquid et eos doloremque reprehenderit deserunt consequatur est distinctio illo qui id voluptatum quia provident tempora repellat et ipsam quae voluptas sunt qui maiores sunt in esse perspiciatis suscipit natus qui vel atque laborum illo ipsam quia rerum consequatur inventore placeat cupiditate non rerum eius qui eaque recusandae incidunt quidem voluptatum ea et recusandae sit et eaque blanditiis quia eligendi nihil aut eos fugit facere velit quia commodi adipisci esse dignissimos at deserunt molestias voluptas aut qui quisquam explicabo qui tempore atque ipsa fuga voluptatibus eius in deserunt rerum ea eum aperiam aut animi sunt distinctio ut repellat officiis id quis aut rerum laudantium perferendis voluptatem autem et et omnis autem dolores vel fugiat doloribus ea unde rerum et quo rem dolores ex aliquam magnam voluptate dolore provident at voluptatem et deserunt at mollitia fugiat animi enim est consequuntur vel fugit non repellat et eum possimus vel aut et quos omnis laboriosam sed reprehenderit consequatur consequuntur alias impedit expedita hic eum et a et delectus tenetur aut commodi odit reprehenderit sint fugiat iusto necessitatibus voluptatem ut ipsum optio maiores aut officiis quisquam eum veritatis atque ipsam sit repellat sit non mollitia laudantium possimus et cum hic molestias quis sunt nesciunt maiores in enim omnis ut accusamus harum voluptas quo consequatur aliquam laudantium enim in architecto in laudantium consequuntur id sint mollitia atque enim autem porro est maiores dignissimos veritatis qui est aspernatur quos cum rerum quos a quam suscipit architecto id perspiciatis quam aspernatur voluptatem est delectus sunt omnis voluptate eum iure nesciunt ea et incidunt odio atque sunt porro voluptatum quis repellat iusto doloribus harum culpa quasi optio sit ad aut aut aut magnam quisquam aperiam reprehenderit voluptatem exercitationem beatae consectetur impedit illo aspernatur quo sunt voluptatibus qui aperiam enim minus et sint culpa hic consequatur eius enim minus tempora ducimus molestiae laborum aut optio cupiditate labore libero sit laborum omnis magni est assumenda tempora unde aperiam asperiores velit quisquam ut eaque neque qui enim commodi repudiandae tempore excepturi pariatur delectus delectus exercitationem non adipisci architecto laboriosam beatae voluptas eum quae sit id modi saepe reiciendis et nisi illo doloribus illum perferendis.', '0', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('305', '9', 'Voluptas et ducimus maiores molestias quam.', 'Dolores dolorum impedit enim debitis reprehenderit nesciunt ipsam nemo velit perspiciatis eos molestias et et tempore dolorum harum aut est velit ad reiciendis quia aut itaque sed occaecati eum ab voluptas tempora temporibus voluptatem aut fugit vel quibusdam nostrum officia ipsam harum ipsa sit delectus quidem molestiae quo possimus ut aliquam nobis voluptas aliquam autem recusandae quis ducimus maiores delectus facere eveniet harum aut iure et sequi autem voluptatem impedit est molestiae ipsam maxime modi doloremque rerum ut error expedita est voluptatum quos voluptas sed qui sunt repellat vel quaerat atque inventore nesciunt quaerat ex beatae quibusdam sed excepturi quae sed laudantium exercitationem quia error voluptas voluptas quo fugit sunt dolore ullam corporis deserunt magni tenetur numquam nihil possimus itaque quibusdam magnam voluptatibus repellat quis autem ut et sunt amet earum qui tempore et rerum occaecati qui voluptas harum aut blanditiis a ut at molestiae ut maxime consectetur a unde corrupti quae officia expedita et eos consequatur temporibus voluptas sunt rem ipsa alias suscipit reprehenderit quia totam id eligendi repellat dolor laudantium ex consequatur alias repellat quia quae nihil harum quaerat saepe culpa amet magni atque ipsam nihil nemo quisquam similique voluptate et est est ipsum nihil et laborum rerum vel officia fugit aspernatur esse iusto aut pariatur debitis illum sit blanditiis beatae molestiae ut cum optio vel nihil est facere nobis fuga rerum natus enim.', '1', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('306', '10', 'Doloribus qui soluta aliquid perspiciatis exercitationem.', 'Repellendus rerum aut velit quo ipsa et iste aut magnam accusamus ab exercitationem quis deleniti doloribus et aut ab impedit sit harum maiores expedita ullam rerum pariatur voluptatem non qui sapiente atque quaerat in reiciendis eos dolorem at enim enim porro error porro aut officia necessitatibus nostrum reprehenderit dolorem natus assumenda asperiores quos ut odio sint eum distinctio inventore consectetur voluptas aut vero a voluptate adipisci ducimus voluptatibus dolorem aut nam tempora et nisi similique porro dolore eaque accusantium eius libero dolorem nesciunt fugiat ipsa corporis harum veritatis et qui qui molestiae temporibus expedita sunt rerum quos accusantium voluptas sunt labore voluptatem deleniti nihil dolore at perspiciatis sunt placeat dolores et harum voluptas et ad et eum et exercitationem voluptatem ab sed dolore ea voluptatibus accusantium nobis voluptate et nihil assumenda id reiciendis laborum aut qui quis ut a quia eum atque ea dolores id quo esse nisi expedita maxime molestias quaerat molestiae cum fugiat vitae et atque accusantium accusamus adipisci esse rerum fugiat ea culpa deserunt reiciendis ut dicta eius sed ducimus quo laborum eius voluptatem tempora porro fugit voluptatem cum commodi eligendi impedit eligendi id atque ea perferendis itaque voluptas fugiat quis ab voluptatum aut in error non ut dolore.', '0', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('307', '6', 'A ratione expedita et aut.', 'Et accusamus illo nulla laboriosam in quod ut nobis eum nam itaque aperiam ad aliquam aut consequatur laboriosam qui unde expedita eum soluta itaque et qui magnam dolores aperiam officia voluptates quis quod accusamus inventore beatae saepe omnis dolore et sunt iusto nobis ea aspernatur exercitationem praesentium omnis ex quia omnis mollitia repellendus aut aut harum quas eum possimus non quos debitis ea mollitia quasi est similique provident aperiam ad voluptatem nihil omnis fuga sit modi beatae velit consequatur iusto voluptatum labore perspiciatis labore dolor voluptate enim veniam sint est sint perspiciatis vero voluptatum doloribus optio quis vero et ab provident quidem rerum est voluptatem eligendi quidem nihil distinctio facilis corporis dolor fugiat eum aperiam et voluptatibus soluta temporibus voluptatem ducimus optio totam maiores quam hic laboriosam sit aspernatur ea quos sint soluta facere aut voluptatem sit laborum iste hic ipsam labore quos quia quidem qui impedit molestiae fugiat quas a alias qui necessitatibus modi voluptas accusamus provident fugit doloribus ut eligendi dolor ratione aut sunt voluptas reiciendis voluptatem in et fugiat voluptatem maxime quia commodi dolorem perspiciatis et ea reiciendis dolorem qui voluptas culpa explicabo ex saepe accusamus esse ullam eveniet ut iure est ut in qui sed eius earum est voluptates recusandae doloribus sint eos veniam corrupti fugiat natus sit doloribus nihil nam eum et tempora esse aut suscipit ut sed temporibus dolorum ut numquam omnis tenetur id adipisci id.', '1', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('308', '3', 'Et ipsam rem qui doloribus quibusdam.', 'Laudantium facere adipisci quo quisquam libero totam dignissimos similique provident ab in quasi itaque repellendus nam et est est dicta officiis ut sit dolores et quisquam odit sapiente in ab voluptas delectus est harum sit sint nobis et dignissimos et ut dicta autem ex commodi ipsum aut ea ducimus eos consequatur reprehenderit similique quaerat accusantium omnis est vel rerum est iure velit quidem quo dolore corporis doloremque in fugiat dolorum repudiandae rerum et suscipit perferendis provident aut distinctio ut nemo odit natus porro est reiciendis enim ut autem dolor quia iure id ad ut quidem sunt natus inventore aut suscipit aut nisi eum laboriosam autem iure qui voluptatem quia corporis necessitatibus reprehenderit nihil et minus exercitationem quos harum omnis et qui aliquam occaecati qui vel ad enim ad ea fugit unde sint omnis officia qui aut consequatur temporibus quia voluptatibus placeat deleniti magni quam aspernatur excepturi quam esse omnis dolorum veniam voluptatum sapiente et eligendi aut sunt modi tempora necessitatibus ut quae asperiores molestiae quas quis cum officia eos nostrum beatae officia temporibus ut eum quaerat cum ducimus in commodi illo ratione aut quod sint ullam omnis exercitationem aliquam et numquam eum consequatur debitis id aut facilis cum accusantium maiores totam voluptas veniam nulla eius nihil earum cumque est nisi eos libero eius perferendis molestiae dolor nihil accusantium repellat eveniet eos quas perferendis non nobis tempora ullam blanditiis sunt est cumque architecto enim eveniet deserunt voluptas culpa perspiciatis.', '1', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('309', '6', 'Et ut qui sint quis temporibus perspiciatis.', 'Fuga aut consectetur possimus atque molestiae aut quis ducimus et aut sit nulla dolor est quibusdam error quis et ratione doloremque ut et magnam quam dolor perferendis soluta distinctio quasi et aliquid nihil cupiditate quisquam in necessitatibus tempore non magni praesentium molestiae ut maxime eligendi iste quidem illum animi aliquam dolorem iste error voluptatem alias eos sint optio repellat aut ad ratione ratione laudantium omnis et consequuntur eum aspernatur atque modi dolor laudantium ipsum quo soluta amet non laudantium quis nulla id itaque vitae ea ut consequatur laboriosam dolores qui autem iste qui molestias aperiam alias ut eligendi facere suscipit sint ipsa iure molestiae assumenda id consequuntur dolorum in omnis dolorem accusamus et qui corrupti consectetur quam commodi quam temporibus velit inventore maxime animi perspiciatis iusto veritatis enim dolorum velit nesciunt sit qui fugit tempore exercitationem libero officiis ullam delectus quia inventore blanditiis error esse dignissimos vitae sit provident explicabo quasi eaque expedita illo optio dolores neque veritatis consequatur asperiores qui nihil ad vero natus sunt voluptas accusamus dolor voluptas est soluta quidem eum et tempora qui quaerat dolorem voluptas labore et incidunt eum praesentium totam quo aliquid consequuntur ut sunt id autem atque est magnam libero doloremque est officiis quae dicta minus eius occaecati consectetur porro saepe vel saepe ipsa ut qui sequi modi ut cupiditate voluptatem alias qui dolor sunt qui aperiam modi quaerat et eum ex cum eum consectetur laudantium officiis et enim voluptatum sed omnis adipisci est nihil laudantium dolore sed molestias in fugit amet dolorem consectetur eos quia voluptas non vitae porro quaerat omnis nulla ratione cum expedita amet sed animi magnam animi repellat id rerum eveniet inventore odio voluptatem et dolores ut molestiae officia quis voluptat