INSERT INTO `course_news` VALUES ('310', '5', 'Blanditiis non soluta harum deserunt aut qui.', 'Sed unde voluptas veritatis harum totam dignissimos sint ab accusantium est saepe explicabo recusandae delectus officia velit qui aperiam dicta voluptatibus voluptatem et est id maiores debitis doloremque dolores minus ut consequatur possimus repellendus rerum veritatis doloremque ipsa reprehenderit omnis fuga occaecati voluptatem dicta autem voluptate ut vel et et quia sed voluptatem voluptas totam voluptatem velit architecto eaque sit voluptatum sit illum placeat sint occaecati non libero nihil dolore culpa et numquam possimus labore dicta aut magnam unde voluptatem aspernatur ducimus nemo magnam consequatur voluptatem et aspernatur cumque beatae aut ut id quidem incidunt sunt voluptatum vel ipsa fuga quae quo voluptatem excepturi quo exercitationem molestias sint deserunt minus a facere enim exercitationem dolores aspernatur fugit nam saepe dolorem beatae odio facilis voluptatum ut ipsum id autem quia saepe id quis aperiam cum atque quos voluptas eius deleniti officiis dolorum sint harum incidunt explicabo qui id autem alias eius autem mollitia sint consequatur distinctio eius vero sed nostrum dolor similique totam at qui sunt nihil voluptatum est nihil alias vero veniam consequatur aliquid culpa ut enim excepturi debitis consequatur aperiam quisquam et nihil sunt alias dolores deserunt assumenda veritatis deserunt tempore asperiores aut beatae esse rerum quidem voluptatem est accusantium suscipit eligendi quas tenetur neque atque sit quo quo aperiam eum saepe omnis ducimus et corporis et dolore esse cum ducimus esse fugit rem dolorem quo odio aliquam fugit adipisci vitae ratione omnis facilis voluptatem corrupti illum excepturi pariatur eos eum numquam blanditiis ipsum quam consectetur aut mollitia aut eveniet aut omnis debitis quibusdam possimus ex omnis praesentium rerum quis enim delectus omnis necessitatibus dolorem quis aut commodi sunt molestiae dolorem sit ea iusto at dolores perspiciatis perferendis sequi magnam qui esse quia voluptatem beatae aspernatur doloribus sequi soluta omnis id et fuga qui neque ut ipsum officia suscipit fuga repellat occaecati saepe delectus pariatur reprehenderit vel natus velit cum rem odit sunt deleniti dolore praesentium ipsam sunt molestiae suscipit voluptas tenetur praesentium voluptatem impedit alias culpa ipsum quia corporis incidunt unde sint rerum perferendis voluptate laudantium sed accusantium.', '1', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('311', '5', 'Dolor inventore sequi mollitia pariatur fuga.', 'Culpa aut voluptatem laboriosam aut ratione vel beatae eaque beatae sed eos nisi ut et vel amet et soluta autem corporis omnis ut eos explicabo corrupti rerum expedita voluptatem quia dolorem esse et ullam esse suscipit neque et maxime est excepturi labore voluptatem nostrum perspiciatis ut consequatur iusto suscipit quaerat voluptas ex dolores quia qui nihil hic doloremque facere atque odio nam ut aut laborum necessitatibus earum quaerat ullam totam veritatis aspernatur exercitationem et esse sed dolore blanditiis corrupti provident molestiae hic aut autem molestias quasi voluptatem quia quia ipsum mollitia beatae officia ex quia nulla nam ipsum ea sed ab perferendis impedit velit consequuntur qui nihil iusto hic modi laborum quia velit et esse alias perspiciatis rerum nesciunt eligendi et nostrum corrupti a fuga fugit excepturi architecto aspernatur labore natus voluptatem quis a molestias quisquam consectetur est illum nihil ut dignissimos porro omnis nam quia qui doloribus alias et dolor accusamus provident nulla deserunt qui illo velit eos tempora sunt aut et ut et dolores voluptatem ex voluptatum repudiandae ut ea ut in maiores repellat est eaque velit veritatis ut mollitia qui numquam corrupti esse quod a rerum reprehenderit eum aspernatur aspernatur vero dolor non laborum blanditiis sint quis unde perferendis error voluptatem harum illo tempora deleniti deserunt cupiditate tempora et voluptatum dignissimos sed quae dignissimos qui et nihil voluptatem ullam dolor dolores molestias neque perspiciatis id quia qui magni quo dolore inventore vel vel non similique rerum maiores est inventore nostrum minus earum sit aut dicta blanditiis et illo nobis nam facilis est totam est debitis quisquam quia laudantium dignissimos eaque veritatis dignissimos amet qui in et dolorem omnis asperiores omnis sint quos dolore dolore sit aut quia minima assumenda quo delectus qui rem et u