INSERT INTO `course_news` VALUES ('312', '5', 'Ullam dolor nulla totam velit aut facilis aut voluptates.', 'Consequatur soluta aliquam sint sunt sapiente dolore voluptas omnis modi quisquam voluptas natus qui itaque ab facilis et ut rerum repellendus temporibus ipsa dolores et architecto aut maxime placeat asperiores et similique sint non debitis aut voluptate eum eum magnam id saepe sed illum tempora quisquam aut inventore quos quo voluptatem dolores necessitatibus iure laudantium facere nostrum eaque ea aspernatur aut et est nulla aut omnis quidem sed qui aut repellat praesentium rerum atque porro corrupti culpa quo molestiae enim consequatur quam aut ut ut ut aperiam doloremque voluptatem reiciendis quis enim et ex omnis voluptate est eaque fugit corrupti possimus autem rerum tempore enim pariatur eligendi quia laudantium ipsam sed perspiciatis dicta quia aut praesentium repudiandae rerum repudiandae quo id dolorem corporis est necessitatibus soluta omnis aut aut ipsam ea sint tempora quia unde cumque quis consequatur tempore consequatur eos excepturi laudantium inventore quaerat dolores nemo dicta dicta labore consequuntur consequatur quas laboriosam sit sed nam dolor consequuntur aspernatur et ut natus praesentium praesentium atque dolores mollitia eius earum dicta vero neque accusamus sint dolore sed culpa harum asperiores nisi perferendis corporis occaecati quia molestiae debitis dolorum sint hic nisi hic rem eos odit distinctio aliquam libero neque et non rerum quis sed laborum et expedita amet libero aut consectetur ex illo veniam.', '1', '2017-05-02 22:59:02', '2017-05-02 22:59:02');
INSERT INTO `course_news` VALUES ('313', '10', 'Dignissimos error et nesciunt harum accusamus aut distinctio.', 'Consequatur aut enim praesentium qui doloremque iure fuga sunt inventore et exercitationem eum quasi labore quos laborum repellendus laudantium facilis velit ducimus et odio similique maxime qui repudiandae sed dolor et qui ut ratione voluptatum ipsum similique dolores deleniti expedita sed et magni facere sapiente fugiat similique quae maiores sint iure id aut quidem voluptatem quo voluptas sed inventore explicabo a maxime nemo sed est ipsa laboriosam sit est accusamus quibusdam sed dignissimos repellendus harum sit deserunt dolores cumque quo voluptatem nesciunt omnis similique ut maiores qui in minima velit saepe libero debitis nemo recusandae soluta quo et laboriosam quia et nemo rerum sed necessitatibus nihil cupiditate error ipsum quis quas sequi provident quos natus doloremque quos est voluptatem rerum enim culpa nostrum asperiores fuga totam pariatur aperiam mollitia rem tempore numquam sed ut reiciendis praesentium et illum veniam qui assumenda suscipit consequatur optio qui reprehenderit maxime quis velit libero unde et cumque laborum molestiae aut in quis laborum quasi nulla a et pariatur et iure necessitatibus dignissimos aut ad voluptatem et consequatur reprehenderit quaerat autem mollitia cupiditate qui labore ea velit ea pariatur omnis consequatur quia unde dolore repellendus nihil omnis dolorem vel nihil iusto reiciendis hic nostrum sit sit quia fugit sunt neque exercitationem cumque saepe dolore ipsa porro velit blanditiis inventore quia soluta autem eveniet ipsa unde quibusdam tenetur et corporis rerum quibusdam et culpa hic quae est dignissimos est et reiciendis sequi nam quia dicta id et autem labore est et quas qui officia consequatur voluptate quia minus enim quis porro repellendus similique consectetur et dicta ut praesentium quia inventore officiis commodi sit necessitatibus dolorem aliquam nesciunt eius similique voluptatem cum vo