INSERT INTO `course_news` VALUES ('325', '7', 'Omnis cum quia beatae animi sit blanditiis.', 'Explicabo non magnam deserunt aliquam architecto ut et inventore veritatis sunt sunt inventore dolor non placeat ut eveniet exercitationem qui aut nihil minima quasi atque dolorum aperiam aut sunt omnis enim nihil officiis rerum accusantium officiis ut quia eos necessitatibus placeat ullam nesciunt consequatur ullam cumque unde blanditiis similique sed fuga tempore enim similique aut enim et reiciendis laboriosam ex commodi vel quisquam voluptatem fugiat beatae occaecati quia placeat ullam aut fugit odio corrupti aspernatur ut sunt voluptates officiis et veritatis corporis perferendis voluptatum aut in nihil delectus ullam ut aut perspiciatis ex laudantium natus quaerat voluptas consequuntur omnis perspiciatis a similique aut dolorem sit neque molestias numquam dolor ea dolor deleniti ad velit iure vero et ut sapiente quisquam aut quia nostrum non et est explicabo aut inventore et quia error et sed sapiente ullam qui totam autem et numquam non ut ut aliquam accusantium enim autem molestiae ut ipsum molestiae consectetur ut consequatur repellat quasi aut est velit qui nemo aliquid quia adipisci error sed tenetur accusamus rerum corrupti eum aliquid eos corrupti asperiores eos labore ea rerum sint id quis accusantium eaque est sit amet ut iure in consequatur esse sequi facere aperiam provident voluptas ipsam temporibus voluptatem optio sint est ipsum autem mollitia nostrum praesentium amet minima quisquam sint voluptatum.', '1', '2017-05-02 22:59:03', '2017-05-02 22:59:03');
INSERT INTO `course_news` VALUES ('326', '2', 'Consectetur minus rerum possimus quo nam et soluta sit.', 'Ea enim aspernatur asperiores consequatur eos ut et molestiae rerum debitis dolorum ut aliquam sit repellat incidunt temporibus quas exercitationem iste aut reprehenderit sit sunt aut eius doloribus ipsam in unde perspiciatis corrupti aut reiciendis temporibus reiciendis consequatur minus alias quia beatae laborum voluptatem ut est veritatis quo in qui dolor et explicabo dolores modi labore optio cumque labore adipisci harum aut ducimus vitae tempora rerum id sed veritatis sit blanditiis doloribus repellat molestiae totam sed iusto quia ducimus perferendis neque consectetur sed voluptates molestiae ut aperiam sequi ea maiores ipsam asperiores temporibus voluptatem id voluptate eos qui neque dolore vel ullam rerum in dolorem rerum minus est corrupti cum aut consectetur sint dolores et corrupti molestiae nisi sunt quo quaerat sint non nisi voluptatum et nobis est maxime deleniti dicta non sed incidunt et et et autem voluptas et facere rerum fugiat mollitia dolor architecto qui mollitia sit dicta non nostrum aut veritatis quae distinctio corrupti beatae eos fugiat aperiam quis adipisci repellat repellat quisquam aliquam corrupti corrupti in eum ratione non et quo deleniti sit qui corrupti et laborum est commodi est eius similique accusamus eius amet ex qui tempore sit alias dignissimos nulla et explicabo placeat placeat odit provident iure natus reprehenderit placeat est eligendi est recusandae aut temporibus sequi amet vitae accusantium repellat recusandae fugiat illo magnam aperiam laborum voluptatem at et eveniet placeat ullam magnam voluptatibus et quos consequatur autem beatae nemo veritatis assumenda provident iste asperiores voluptatem voluptatem eius quia sequi nulla asperiores similique occaecati omnis sint optio asperiores et.', '0', '2017-05-02 22:59:03', '2017-05-02 22:59:03');
INSERT INTO `course_news` VALUES ('327', '4', 'Fugit quia ducimus magni dolorem voluptates ut.', 'Et ex recusandae ad non praesentium et et consequuntur dolorem voluptatem quis iusto sed quos eum facere culpa consequuntur voluptate enim veniam quam enim iusto est voluptatum sit qui qui reiciendis cupiditate labore harum magni laudantium et eveniet qui excepturi consequatur quibusdam laboriosam nulla corporis voluptas et atque aspernatur sed omnis tempora qui accusantium quis sunt consequatur odio delectus velit et quidem laborum ratione qui aspernatur hic voluptate aut et cumque non eveniet unde earum illum quis vitae consequuntur a nulla vitae veniam atque praesentium natus maiores ipsa eum quidem recusandae odio quo eius provident amet modi assumenda voluptatem aspernatur maiores fuga et fuga id tempore omnis facere aperiam voluptas maxime similique amet eum voluptatem harum similique nam vero quisquam corrupti modi possimus esse consequatur eligendi ex asperiores temporibus omnis explicabo modi qui et quia velit aut iste tenetur dicta ut minus aut ut magni corporis deserunt distinctio illum quod consequatur sit et officiis id officia illo ab et molestias qui autem temporibus cupiditate amet iste dolores porro a corrupti quisquam voluptas cum recusandae ratione pariatur fugiat eius est vel enim deleniti autem at laudantium id et sapiente illum necessitatibus voluptas nihil at deserunt architecto quis quis reiciendis sed at et tempore et consectetur quod incidunt eaque error natus eius quaerat deserunt rerum consequatur fugiat et et.', '1', '2017-05-02 22:59:03', '2017-05-02 22:59:03');
INSERT INTO `course_news` VALUES ('328', '10', 'Magnam iusto a harum praesentium.', 'Debitis debitis quo itaque cumque est debitis voluptatem saepe occaecati pariatur eos commodi eos at fugiat facilis culpa aut libero autem neque sint rerum id voluptatem sit et quis dicta enim est rem omnis quia aliquid quis debitis natus voluptates a voluptates minus omnis accusamus et iste non et consequatur quia aut ipsum mollitia sit molestias officiis amet rem dolore et nemo laboriosam illo commodi ipsum necessitatibus aliquid cum rerum quos voluptate voluptas a aliquid odio omnis neque est amet dolores maxime accusamus ut quo et molestiae molestias quam aut error nostrum ea dicta et ipsum placeat non et architecto velit vel eligendi rerum impedit itaque eum repudiandae molestias optio debitis ea odio sed consectetur laborum ut aperiam eum vel qui corporis aspernatur id enim qui vero temporibus nisi nesciunt velit laudantium ipsam nostrum tempore molestias dolor ab consectetur blanditiis nisi doloribus iure debitis id optio ut corrupti maiores et nostrum dolorem eum molestiae maxime non odio quia aut facilis sit laborum veritatis illum et ut nesciunt reprehenderit tempora quasi perferendis culpa dolorem quae aperiam consequatur nobis sunt eum qui voluptas accusantium asperiores et veritatis vel ab eos fugiat rerum voluptatem aut sint molestiae beatae aliquam aspernatur culpa sit laudantium minus neque corporis tempora accusantium dolor aliquam tenetur expedita rerum magni aut excepturi enim necessitatibus eum quod id molestiae placeat omnis necessitatibus enim reprehenderit praesentium omnis qui eius nesciunt et voluptatem ex accusamus reprehenderit nemo consectetur quia sequi rerum voluptatem saepe sed facilis veritatis maiores totam voluptas et sed voluptatum praesentium cum eos facilis et magnam assumenda ratione et beatae nihil placeat aut neque hic vero accusantium fugit iure porro tempore et voluptatem dolores quo nihil numquam perspiciatis id saepe eum est sed in non cul