INSERT INTO `course_news` VALUES ('329', '9', 'Sequi alias illum et beatae aut maxime.', 'Natus tempore et nostrum soluta qui fugiat enim culpa accusantium possimus consequuntur necessitatibus itaque et in modi quasi est placeat aperiam et minima dolorum eaque ut cumque cum numquam aut fugit corrupti repellat sed reprehenderit molestiae explicabo quasi officia optio odio optio et velit rerum officiis saepe rerum est maxime dolor dolor eaque quidem autem provident dolor est fugit aspernatur aut earum consequatur ut qui tempora sunt error quia velit similique rem vero amet exercitationem voluptates debitis laborum id id suscipit cupiditate facere nemo delectus possimus ad labore tenetur dolorem assumenda soluta et assumenda rerum eveniet facere molestias qui dolorem dicta qui ea mollitia a omnis sed enim qui voluptas illum possimus ipsam iste neque at qui incidunt quasi rerum voluptas accusantium iusto architecto et id corporis ex sit iure illo enim quia eum doloribus quia omnis autem accusantium aliquid sequi assumenda assumenda est odio sapiente eum et minus ea reiciendis voluptatum repudiandae dolor delectus quos saepe dolorum consectetur voluptas non incidunt sit quos illum ab at consequuntur dicta laudantium voluptatem atque exercitationem non soluta voluptas fuga voluptatem eos aliquid aut consequuntur architecto quos fugit qui doloremque quidem sed at et et quibusdam sed est blanditiis minus perspiciatis minus ipsum placeat dolores aut reiciendis et temporibus recusandae alias aut est culpa aperiam dignissimos est fuga quidem natus eaque voluptas magni nisi ipsa laborum dolorem odit recusandae odio quibusdam libero et beatae minus labore aspernatur esse reiciendis sequi nam perferendis illum voluptates dicta reprehenderit et eligendi sit natus unde voluptas et recusandae quia delectus itaque ea aperiam autem error non atque rerum corporis veritatis distinctio ex qui dignissimos laudantium qui repellendus esse itaque iure qui doloribus vero corrupti et qui at rerum ipsa asperiores nihil aperiam accusantium vitae dignissimos aut dolorem consectetur enim itaque est autem sunt non ipsam laudantium sed autem voluptas itaque a voluptas eaque sequi aliquid non minus suscipit et inventore aperiam et omnis autem aut quia debitis impedit sunt ut voluptatem eos fuga deserunt distinctio modi qui fuga reprehenderit est veniam quo reprehenderit mollitia voluptates et saepe id a consectetur consequatur iusto quisquam dignissimos aut tempora incidunt esse illo ab qui voluptatem tempora sunt voluptatibus delectus placeat voluptates consectetur fugiat consequatur porro culpa aspernatur sint voluptates veniam et quod voluptatem sint blanditiis ipsum laudantium eveniet provident ut velit dolorem aut deleniti officia reiciendis aut expedita eius rem qui dolorem facere iusto iusto dicta ut.', '0', '2017-05-02 22:59:03', '2017-05-02 22:59:03');
