INSERT INTO `course_news` VALUES ('331', '7', 'Et consequatur pariatur aliquam et excepturi et rerum laudantium.', 'Modi fugiat fugit voluptatibus ad minima modi esse non impedit facere et ut autem odio qui quo occaecati a reiciendis aut tenetur sapiente maxime reiciendis delectus sed commodi sit inventore et ducimus quo vel dolorum voluptas asperiores delectus laborum vel repellat aliquid nihil qui odit voluptatem voluptas maxime ea qui aliquam quis rerum ex rerum itaque inventore et necessitatibus soluta voluptas qui sapiente eum repellendus iusto saepe aut qui dolorem non rem veniam voluptatem sed sed et et iste ducimus non et possimus vel quos non quo numquam in voluptatem qui rerum ipsa temporibus saepe praesentium natus veritatis rerum autem hic quisquam neque consequatur accusantium qui assumenda ab dolores ducimus nobis quia in placeat tenetur sunt in explicabo corrupti maiores id pariatur adipisci iste nihil vitae consequatur praesentium quia doloremque amet neque dicta et eos aliquam et unde porro nam ut maiores inventore perferendis blanditiis et voluptate aliquam aut qui totam in quos occaecati laboriosam ea et deserunt et et doloremque qui consequatur quisquam eum asperiores debitis quos quia repellat sit a expedita et cum ea consequatur est voluptatem voluptatem recusandae illum vel repellendus aliquam voluptatem aspernatur amet possimus et facilis ut voluptatem illo tenetur qui fuga incidunt iure aspernatur ad quia consequuntur dicta porro excepturi quis placeat odio ea voluptas doloribus quod quas sunt eum aut eum quam accusantium laborum perspiciatis sapiente velit vitae assumenda dolorum eaque placeat soluta ducimus quis ullam ad vel hic rerum dolorem nesciunt veritatis nulla fugiat sed qui et beatae veniam voluptas sit nisi aut ratione tempora et blanditiis qui commodi ab nisi molestias harum voluptas assumenda dolor nemo vitae at sint optio error repellendus enim nulla omnis sed sint neque dolores deleniti deleniti blanditiis sit omnis quidem voluptatibus corrupti consequatur est et dolorem molestias non laborum tenetur eveniet molestias aut eaque eum error quos neque vitae ut sunt quo nihil perferendis nemo facilis quia nostrum qui id quo fugit labore autem exercitationem.', '1', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('332', '7', 'Culpa ipsum suscipit consequatur sunt ipsum aliquid quod.', 'Minima ut doloribus a rem eligendi praesentium alias dolore fugit animi qui ipsum modi tenetur beatae dolor vitae suscipit molestiae nostrum fuga vel itaque dolores esse cumque doloremque culpa architecto consequuntur illum dolorum ut ut non saepe consectetur id molestiae in aut provident aut eum aut sit voluptas autem eligendi vitae delectus ratione enim voluptates aliquid consectetur vel animi aut dolor nihil et veritatis non velit id quod et et sed maxime dolore temporibus alias non nobis autem cum repellendus nihil et ut sapiente rerum autem aut porro et possimus numquam ipsam iste saepe dolor ea ut quis libero temporibus consequatur ratione harum rerum dolorum consequuntur autem sed dolor labore consequatur veritatis autem inventore sit similique sit delectus facere atque at et assumenda animi est quam ut ut quasi in possimus sed saepe numquam voluptas et repudiandae earum dolor et quidem ea veniam aperiam harum sed corrupti eligendi quae dignissimos et esse perspiciatis numquam dolores dolores non recusandae et sapiente adipisci ea tempore fugiat distinctio a dolor sit dolorem dolore veniam impedit omnis et quia corporis qui omnis provident omnis doloribus omnis dolorem rerum.', '1', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('333', '6', 'Magnam qui molestias eum optio voluptatem asperiores similique.', 'Deleniti aut ut et incidunt magnam temporibus dolorum et tempore at animi necessitatibus sunt deleniti sunt magnam id eligendi quas tenetur tempore corrupti autem earum recusandae ullam dolorem corporis quos voluptatem ut voluptas quia voluptatem autem et sapiente quia qui quaerat qui voluptas sit vel voluptatum quisquam doloribus hic necessitatibus laudantium sed et tempora ut et modi libero consequuntur vel officia molestiae aut consequatur qui officiis nesciunt et suscipit quod qui alias suscipit dolores exercitationem quod perferendis natus aut esse nisi et illo exercitationem voluptas rem eaque facere vitae omnis enim asperiores dignissimos quia blanditiis quibusdam voluptas reiciendis sint blanditiis enim impedit dolorem sed autem sequi ut voluptatem dolorum dolores dolore aut asperiores ut minus incidunt quasi eveniet eum ex ipsum laboriosam exercitationem non dolores sint error quia expedita sequi corporis error nobis error blanditiis repellat vel voluptatem doloremque eos laboriosam voluptas atque odio dicta quidem eveniet id id aut temporibus recusandae labore qui blanditiis dolorem exercitationem ut id cumque porro nulla aut sit et necessitatibus qui asperiores perspiciatis qui voluptatem provident culpa molestias laudantium eos sit et soluta voluptatum nesciunt voluptatum occaecati harum iure similique est doloremque sit debitis inventore a labore vero quo id non earum architecto voluptatum nisi nostrum voluptatum dolorem dolores aliquam consequatur vel dolorum distinctio nemo possimus velit explicabo commodi modi eius commodi ratione repudiandae provident amet qui voluptatem ut assumenda aut illum distinctio cum ullam cumque omnis perferendis error natus quia voluptate numquam qui non illum dolor consequatur veritatis ut quam aut ab laborum quisquam magnam quibusdam voluptas atque omnis accusamus sequi ea ipsam saepe quod enim totam corrupti