INSERT INTO `course_news` VALUES ('334', '6', 'Et nihil tenetur nihil dolorem tempora sint dolorum.', 'Commodi aut expedita labore natus ducimus harum ipsum fugiat et perferendis veniam veritatis sit voluptas placeat tempore qui mollitia repudiandae nihil quisquam placeat debitis rerum iste corrupti sed quia pariatur omnis ad id eius ut facilis voluptatem aut recusandae consectetur dolorum est optio aut ex temporibus doloremque doloremque nostrum reiciendis nulla labore numquam qui atque vitae quam dignissimos a cumque pariatur placeat consequatur est qui magnam temporibus repellendus at cumque necessitatibus tempora voluptate impedit aut quidem sunt placeat quibusdam et rem quibusdam sapiente et dolorem quos et et temporibus iste impedit quisquam ut nobis quasi tempore eveniet minus ut enim repudiandae distinctio voluptates accusamus qui incidunt praesentium non ratione et recusandae fugiat molestias optio enim omnis ut vel sit quo consequuntur consequatur officiis est cum reiciendis illo accusantium voluptate deleniti est itaque quae fugiat temporibus molestiae natus enim libero doloremque rerum totam animi voluptatum quis doloribus quam inventore ea quia distinctio alias quo et adipisci eos totam odio odio maiores minima nihil laborum debitis qui autem debitis dolorem nemo sit earum maiores repellat sit facilis et itaque iusto delectus neque vel sunt accusantium nobis assumenda commodi quia adipisci asperiores nemo illum temporibus est iure est dolore vitae praesentium totam rerum nihil ut incidunt tenetur velit quis commodi ea adipisci inventore voluptas perspiciatis praesentium atque eos laboriosam sapiente est ipsam incidunt id voluptas reiciendis eaque voluptate nihil asperiores ea et iste maxime vitae deserunt natus recusandae magnam cum molestiae dolores aliquid officiis sint beatae quia omnis iusto voluptate nobis in quibusdam dicta nisi suscipit excepturi qui voluptas est nam nobis inventore dolores incidunt ea quos fugiat ea at voluptatem aut quos sit re