INSERT INTO `course_news` VALUES ('335', '3', 'Neque consequatur error sunt amet.', 'Non et voluptas ut sapiente nihil quis sunt eligendi quae eos magni exercitationem sit beatae quod excepturi sequi et ab ut optio iste saepe illum non aperiam sint neque error qui eaque ut natus quia quo quia quasi nostrum aliquid qui eos consequatur maxime et quam sed id qui possimus eaque esse molestiae veritatis repellendus et sint sint voluptate in enim iusto sunt ab quia sit eum eaque autem quidem culpa quis est non earum officia sed cum voluptas accusantium assumenda adipisci ab assumenda molestiae quasi est labore quo sint quas aut laudantium nam laborum fuga provident eveniet et rerum quibusdam in vitae reiciendis inventore eum eos error nemo molestiae itaque voluptas sapiente libero repellendus et nisi sit sed fugit id sit velit molestiae repellat quas rerum consectetur commodi qui rerum aut et est aut est et consequatur et iure ratione facilis minima quia at soluta amet itaque sit harum est nesciunt similique magni quis placeat nesciunt quos quo quis qui ut quia magni sit natus quam doloremque exercitationem quidem dignissimos nesciunt est dolor voluptatibus quisquam nulla exercitationem quas quo nisi sit temporibus eligendi dolorum reiciendis deserunt expedita alias explicabo ut qui exercitationem itaque est harum praesentium fuga consequatur ea accusantium tempora iusto animi iure nesciunt natus sunt voluptatem quasi consectetur velit fuga ut eos omnis sunt rerum dolorem debitis incidunt aut dolorum omnis aut ratione et beatae unde delectus earum praesentium debitis fuga itaque qui ut totam animi ea a blanditiis veritatis doloribus dolores suscipit reiciendis eligendi error voluptatum tempora architecto ipsum aut sed quis esse sapiente quia aut nulla qui qui et quo cum dignissimos quasi ut magni voluptate harum optio quidem nisi fugiat aut et non sapiente et voluptatem autem deleniti aut corporis maiores enim omnis sed ea voluptatem numquam sint optio voluptatum et nihil