INSERT INTO `course_news` VALUES ('336', '8', 'Quia unde rerum ab vel numquam molestias.', 'Veritatis magni voluptatem est dicta rem quaerat sunt tempora accusantium enim aut non ratione molestiae quisquam sed alias non rerum et sapiente officia cupiditate modi et fugiat dolores quos voluptatum aspernatur ipsa soluta ut cupiditate aliquid nisi et officiis nam quasi voluptatum numquam est facilis doloribus qui adipisci cumque rerum aspernatur dolor molestiae at eius sed vitae quis et asperiores id vero autem commodi molestiae ut et recusandae officiis quisquam voluptatem aut sint omnis ullam ad aut quam corporis architecto neque aut qui ad sed aut qui nostrum distinctio minus aut et et minus et nobis nesciunt perspiciatis explicabo odit velit est quas magnam optio nisi officiis saepe qui sed id quas est eos esse deserunt a expedita optio voluptate dignissimos quo non in ad nesciunt sed debitis officiis dolores assumenda temporibus ipsum libero nihil est similique nulla nemo ut eius adipisci illum officia consequatur laboriosam quos ut quidem totam velit in harum harum atque quibusdam eum eum placeat corrupti occaecati laborum est repellat ullam possimus doloribus excepturi pariatur est est ut quae nihil nulla omnis nihil maiores culpa et distinctio omnis error qui eveniet sed tempore quisquam odit est aut distinctio et incidunt itaque et in saepe nihil et et consequatur sequi quam animi error id dolorum totam temporibus porro vitae libero eum aliquam velit laboriosam aspernatur corporis et eius laudantium non error odit et dolorem consequatur est totam sit dolorem esse aliquam qui aut corrupti nisi ex corporis rerum sapiente nemo ut sunt sapiente vero ab velit dicta quibusdam eligendi quae modi dolore vero possimus laudantium odio enim dolorem earum dolores nulla culpa aliquam hic dolorum rerum autem itaque voluptatum doloremque et ea velit nihil et nesciunt qui iste ipsam deserunt perferendis ab consequatur illum in laborum quis quia iste ratione hic tenetur sint dolor minus sed ea ea natus dolorum nisi quo nihil sed totam et consequuntur non nemo consequatur fugiat omnis sed ducimus voluptates voluptas labore quidem et itaque laborum aut est in aspernatur quod optio dolores nihil porro et unde neque aut asperiores ut velit aspernatur excepturi omnis nihil ex aliquam tenetur reprehenderit adipisci aut repellendus consequuntur dolorum maiores aut unde vero dolores ut eveniet nihil sed quia quo dolorem non dolores eum ratione consequatur amet aut aut est eum nam quis et architecto.', '0', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('337', '3', 'Ullam pariatur id facilis ipsa.', 'Autem aut omnis et ut consectetur sed dolores quam qui ipsa sint nam temporibus quis aliquid qui et enim sit nesciunt qui eum deleniti voluptates necessitatibus delectus non cupiditate voluptas molestiae et consequatur libero nulla esse dignissimos provident in ea voluptatem et perferendis tenetur eligendi est quis adipisci vero nulla consequatur minus molestias ipsam sed laudantium impedit explicabo quod aliquid similique debitis ipsam voluptatem non magni labore non reiciendis sed ut ut sed voluptas totam et laudantium vel voluptates eveniet reiciendis non consequuntur eum autem et voluptatem nemo aut ea repellat atque eum vero sint at aliquid ipsam ipsam corrupti repellat repudiandae natus et est nisi omnis quidem quam repudiandae ut omnis aut nemo animi reiciendis sunt ducimus hic odio quia necessitatibus nostrum voluptates vitae ut ut iusto corporis minus et aspernatur quia inventore dicta laboriosam eum porro aut animi cupiditate explicabo voluptatum voluptas eum sed earum labore aut reprehenderit tempore ea eius vitae qui ratione asperiores itaque qui magni neque consectetur consequatur dicta recusandae qui accusantium esse asperiores est distinctio fugiat sed harum laborum rerum quia porro numquam aut eos ut eos eum eaque maxime dolores quod quasi sit minus qui dolores perferendis vel et eos enim necessitatibus assumenda et reiciendis ut temporibus sit alias nam odit iusto est aut quisquam et porro vitae cumque qui voluptas ab non sit cupiditate omnis quo soluta suscipit voluptas officia aliquam doloremque voluptatem at qui sed ea et aut quidem tempora hic modi assumenda exercitationem qui sit in et et deserunt iure.', '1', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('338', '7', 'Dolorem eos fuga et explicabo ad et quia.', 'Et enim impedit ipsa cum minima minus aspernatur veritatis expedita quod possimus est voluptates et delectus ut voluptas facere aut quod adipisci labore voluptas sunt magnam accusantium id voluptas sequi quo necessitatibus amet ullam eligendi vero aut earum recusandae culpa quo autem perspiciatis et ut omnis id sed mollitia dolorum voluptatem in aut saepe quis dolores accusantium esse aut et quod quo commodi sequi dolorem rem accusantium voluptates consectetur eos quae minus nemo officia nihil laborum pariatur perferendis sint possimus atque dolor adipisci molestiae non quidem iure sed doloribus et qui error alias dolorum officia deleniti aliquid deserunt explicabo et molestiae quis vel ut corporis dolor facilis sint earum amet id in nesciunt qui est nulla et error sit est velit adipisci aut itaque dicta qui adipisci facere aut qui quasi velit voluptatem quis enim ea fugit illo laudantium odit quo quis tempore dignissimos temporibus fugiat doloremque quam quidem ut omnis veniam deleniti inventore occaecati non omnis minus itaque natus voluptatum amet excepturi corrupti excepturi fuga deleniti id vitae architecto sunt vitae iste sit ab et consequuntur optio quidem voluptas laborum consequatur sed quis cum hic sequi est est ea beatae quos a sit neque illo ea voluptas atque corrupti ipsum sint aut at quis in voluptate eius suscipit atque veritatis labore enim a temporibus aliquid aperiam ea id vel laboriosam ea quaerat dolorem dolores error nemo consequuntur tempore aliquam voluptas quibusdam qui dolor est earum magnam porro vel tempore temporibus dolorem enim amet consequuntur consectetur quae iure perspiciatis quia optio ex voluptatem aut explicabo ut non vel rerum velit consequatur adipisci qui corrupti optio repellat quo dolorem reiciendis qui explicabo distinctio dolore consequatur libero assumenda qui et voluptatibus aperiam suscipit a tenetur recusandae aut ut delectus et