INSERT INTO `course_news` VALUES ('339', '5', 'Officiis quia quis similique occaecati fuga iusto voluptas.', 'Perspiciatis ut voluptas harum qui atque deserunt fuga recusandae id sunt culpa enim impedit dolor odit ad iusto ex ratione temporibus laborum eum itaque atque deleniti suscipit pariatur quia similique dolores et cupiditate aspernatur facere molestiae voluptates omnis nostrum in et ut voluptas magni mollitia sint aperiam quae amet sed tempora culpa ducimus non debitis et adipisci expedita quibusdam quae ea iure ex ipsam expedita est veniam voluptatibus aut eligendi dignissimos iusto possimus natus sit praesentium explicabo aut quas dolore incidunt occaecati aliquid veniam est aut ipsam ut omnis sed neque consequatur voluptas perferendis est et libero soluta non voluptatem dolores asperiores facere est occaecati tempore ut esse similique debitis magni est quia doloribus sit commodi ex eaque ut nam cumque nulla laudantium quia delectus qui quisquam in quas dolorum at aut occaecati perferendis officiis ea dignissimos perferendis consequatur tenetur mollitia et nostrum nihil quos et dolores eos quaerat perspiciatis perferendis voluptatibus ut rerum sint est voluptatem commodi omnis nemo molestiae qui non ut ipsa dicta iusto sed cum blanditiis et similique et ipsa laboriosam et aut debitis adipisci saepe aspernatur alias quod atque voluptatem est iure optio sapiente sequi dolor eos architecto esse ut sed facilis aperiam sed unde quasi expedita natus et et exercitationem nobis dignissimos nobis quaerat impedit repudiandae voluptate nisi blanditiis ipsam nam ut nemo eligendi modi dolore eum repellendus qui consequuntur voluptatem est odio consequuntur quod quia sunt unde sit dolores molestiae aut molestiae ad reprehenderit temporibus occaecati perferendis blanditiis error voluptatem praesentium numquam necessitatibus possimus illo dolores nostrum sit id provident numquam sint quo cumque minima asperiores quam magnam amet dolore animi quo velit dolore quia et debitis est hic dignissimos omnis et nobis repellat doloribus ut dolorem vel inventore quam sit dolorem cumque rerum perferendis debitis qui totam voluptatum quibusdam architecto et quibusdam minima explicabo consequatur aut sit iure quo ut voluptatum in nam magnam in neque et et odio deserunt impedit soluta modi eum rerum dolore vel eum cupiditate ut et neque adipisci quisquam praesentium qui officia voluptas ut laborum explicabo atque ex non voluptas dolorum nihil quis perferendis perspiciatis similique esse repellendus distinctio deleniti nesciunt natus consequatur distinctio ab excepturi saepe sit consectetur blanditiis iusto molestiae iure quae reprehenderit pariatur quae qui voluptates soluta suscipit earum et a tempora sit est ut ullam qui id repellat odit id vel.', '0', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('340', '7', 'Sequi velit modi minima et ut.', 'Autem nemo facilis sapiente ut ullam quos quia ut veritatis recusandae ipsum enim voluptatem provident distinctio inventore optio culpa facere saepe perferendis reiciendis accusamus enim molestias alias temporibus consequatur consequatur exercitationem animi quia blanditiis est voluptates commodi eum sit aspernatur illum deleniti quaerat qui sequi in quis inventore dolorum deserunt qui tenetur nihil rerum quis qui a consectetur sit dolor ex sit reprehenderit provident in iusto quisquam vel ab hic qui nulla quasi quod est facere deserunt non labore natus autem nulla et sapiente fugiat et dolorem in at voluptatem itaque voluptas illum id ut omnis qui delectus labore perferendis est facilis ea voluptatem aspernatur expedita ratione facere consequatur maiores quaerat enim illum officia dolor minus expedita aliquid voluptatem repellat tempora delectus dignissimos id in rem saepe magni esse sint id consequatur est libero enim officiis aliquam voluptatem voluptas unde dolores ea ea eos porro qui molestiae voluptates commodi quisquam nisi nihil itaque quia est optio numquam tempora vel voluptas cupiditate aut eos necessitatibus distinctio nulla debitis voluptatem corrupti aut neque ut voluptatem dolores aperiam necessitatibus voluptas aspernatur quia et non corporis modi rerum illo tempora quasi aliquam nobis impedit similique molestias delectus voluptatibus est et similique quasi non molestias ex velit blanditiis alias aut officia laboriosam cum non suscipit et ipsa ea voluptatem ipsum non dolores numquam odit molestiae amet nobis eligendi.', '0', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('341', '9', 'Ut ut earum debitis animi.', 'Reprehenderit tempore consequatur et fugit aut unde quis necessitatibus occaecati dolor omnis error nihil veritatis itaque fuga porro omnis quia ipsam hic est sit reprehenderit aliquid hic enim ipsa similique delectus et assumenda ipsa ullam libero animi velit quibusdam laudantium similique quia non numquam in et vero provident quibusdam maxime reprehenderit praesentium et accusamus animi porro nobis tempore nam inventore voluptatem temporibus cum et id est voluptatem reprehenderit dolorem ab ut rem quidem neque soluta quod quo ut et aspernatur consequatur nesciunt voluptas impedit quo pariatur placeat aut ut saepe et fugiat tempore temporibus accusantium voluptas temporibus vel placeat itaque debitis omnis cum impedit illum tempora voluptate vel pariatur sed qui corporis dicta soluta maiores qui dolore rem earum ut aut est explicabo eaque aut ducimus reprehenderit officia autem voluptatem inventore consequatur similique voluptas voluptatem dolor fugit et perferendis ut labore sint omnis temporibus ipsam itaque neque ea dolor autem provident et mollitia deserunt alias minima reprehenderit provident et laboriosam delectus sed quos aut corporis et voluptate similique quidem magni nisi perferendis quo explicabo laboriosam velit vel est adipisci maiores corporis qui ea quia quam quas ab voluptas qui tempora libero excepturi qui sit id corrupti blanditiis velit sunt illo sequi vel porro ducimus enim consequuntur quod dignissimos quisquam ex veritatis sit quod quia aut similique facilis minus sit est enim enim repudiandae tempore ut molestias aliquid aut autem iure laudantium velit quod delectus porro nemo quo ut voluptas consequatur ut voluptatem sit dolorum rerum fuga quis tempore et error cumque tempora accusamus exercitationem dolor aut autem perferendis fuga est ducimus tempora quis ex sint exercitationem excepturi soluta rerum molestias placeat labore et atque nulla et sapiente fuga eligend