INSERT INTO `course_news` VALUES ('342', '3', 'Quo ut sequi consequatur nihil.', 'Et vitae ducimus dolores excepturi eaque id et provident corporis voluptatem ut corrupti aperiam iste excepturi recusandae corrupti corporis nostrum labore minus doloribus saepe molestiae reprehenderit quia quasi enim consequatur mollitia hic cumque fugiat voluptates dicta nulla voluptas et est rem aut maiores sit iure magnam impedit distinctio nobis et aliquam consequatur debitis et dolore eius sint pariatur quam ut velit eos id praesentium perspiciatis possimus animi ea molestias at et rerum culpa commodi ut fugiat molestiae quisquam qui et consequuntur voluptatibus non qui quod qui reprehenderit aut ducimus dolores earum voluptas voluptas unde repellendus velit est recusandae enim possimus sit ex fuga exercitationem maxime velit ad atque nemo repellendus sunt est nesciunt voluptatem corporis aut natus et deleniti nihil aliquid quo est consequatur beatae veritatis consectetur et ut atque similique quos nobis ut dolorem reprehenderit illum ut dignissimos reprehenderit itaque est nam a voluptas quod eius voluptatibus fugiat reprehenderit eligendi doloribus corrupti quasi enim necessitatibus eos repudiandae blanditiis nulla repudiandae ratione blanditiis excepturi iste itaque culpa est quibusdam placeat reiciendis voluptatem velit voluptas harum similique minima hic et beatae blanditiis totam nobis in voluptas est voluptates et repellendus sint deleniti omnis ut optio necessitatibus consequatur sit quos ut asperiores est velit soluta illum accusantium praesentium tempore voluptatum occaecati recusandae totam sunt culpa ipsa rerum debitis ut et et unde nihil dolores placeat et et consectetur expedita possimus eos fugit autem officiis incidunt quae rerum alias minus aut ut reprehenderit vel molestias aut quia nihil sint et possimus blanditiis et voluptatem eos consequatur sunt est consequatur quae atque accusamus doloremque consequatur sint qui culpa sequi natus a officiis vel perspiciatis et quam quas aut odio corporis aliquam error dolorum aut eos quis id rerum maiores quaerat quae minus vel quaerat eveniet magnam sit quibusdam qui beatae dolor officiis veritatis eaque eligendi officia modi ut qui aspernatur consequatur et quod alias odio dolorem dolor quia amet ut qui ut quas voluptatibus voluptas ad rerum sint veritatis in perspiciatis facilis adipisci nihil nihil eligendi cupiditate nostrum quibusdam quod magni alias nihil cum similique ut soluta assumenda labore eos libero sapiente asperiores nihil voluptatem qui pariatur nihil molestiae architecto omnis quia voluptatem sed nesciunt autem nam natus rem ut numquam vel magni harum mollitia et vel commodi ab occaecati sed dolor magnam dignissimos vel non quia corporis repudiandae nihil non accusamus deleniti sunt placeat provident tempore nisi.', '0', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('343', '3', 'Ut voluptate corporis dolores ut.', 'Qui mollitia atque facilis eaque vero quisquam accusantium quisquam placeat totam perspiciatis repellendus fugit est tempora doloribus fugit voluptatum aut delectus earum labore voluptas ut quas consequatur et rerum voluptate pariatur quidem ut illo quia deleniti expedita et nemo iusto atque rem voluptas quis quia dolores non culpa omnis omnis enim magnam sint consectetur et autem quas rerum consequatur dolor veniam ipsa reprehenderit tempora commodi minus laudantium consequuntur quas non debitis quia quis nobis qui et consequatur autem eius maiores corrupti deserunt molestias amet quaerat ut voluptatem deserunt vitae repellat qui quae totam consequatur fugit maxime rerum cum eum fuga fugiat similique ducimus reprehenderit sed ipsa ad voluptate quisquam dolore eius aut aut cumque voluptate hic ut voluptas dolores ut repellendus tenetur ducimus ut iste velit voluptatem non nisi quia facere voluptas sint perspiciatis eos quia ullam sunt excepturi maxime dolorum architecto enim nihil consequatur quam similique quaerat tempora et dolore ut laudantium similique aspernatur necessitatibus sapiente sed et cum quia rem qui nesciunt assumenda possimus sed ut illo illo dolores inventore omnis quibusdam et rerum recusandae incidunt distinctio et ipsa corrupti temporibus aut nulla minus porro perspiciatis odio corrupti omnis qui ipsum sunt perspiciatis culpa qui nihil quam dolor dolorum aut assumenda ut cupiditate est iure et ut voluptas dignissimos ut quo qui vel inventore porro vero iusto tenetur expedita sit aspernatur molestiae et sit qui sed possimus omnis quo aliquid non enim magnam dolorum aut voluptatem aliquam quod tempore cumque consequatur quis et tempora qui sunt est voluptatum dolores facere qui quasi id blanditiis ex ut modi error voluptatum in voluptatem aut tempora et quia minus unde et voluptatibus facere harum itaque fuga molestiae odio repellat et voluptas facere voluptatem animi error iure voluptatem doloribus sed vitae eos iusto accusantium ratione sit dolores non ipsa laborum enim adipisci nisi est molestias in voluptas est blanditiis reprehenderit vero mollitia in in voluptates totam distinctio ut et qui rerum provident quidem laborum praesentium error nihil occaecati deserunt consequuntur quae cupiditate magnam maiores iusto qui nihil qui tempora necessitatibus perferendis et dolores aliquam rerum et harum exercitationem cumque labore omnis delectus veritatis velit repellendus voluptatem impedit quae totam qui.', '1', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
INSERT INTO `course_news` VALUES ('344', '3', 'Ab quia dicta beatae molestiae ipsam molestias praesentium unde.', 'Atque vel est atque eos quod qui ipsam veritatis nihil et autem quia possimus qui eum commodi temporibus et ipsa nobis non quo culpa mollitia molestiae aliquid rerum perspiciatis voluptatem architecto molestiae mollitia neque officia aut eos corrupti nihil quibusdam voluptate similique quod quaerat rerum accusamus qui harum et explicabo nobis et hic aliquid autem eaque saepe veritatis et et aliquam soluta inventore nemo vero in neque vel quia reprehenderit sint itaque optio similique ad velit natus nam blanditiis perspiciatis sunt dolor mollitia sint autem non voluptatem perferendis non dolores architecto porro quisquam quis et illo praesentium laudantium voluptatem eius voluptatem laboriosam esse voluptatibus enim ut ut unde consequuntur eaque et corrupti enim quasi ut et sint deleniti eos consequatur commodi corporis voluptas repudiandae libero consequatur labore beatae quia voluptates molestiae voluptate eaque fugiat harum quod exercitationem vel tempora voluptatibus eligendi delectus odio fugiat voluptatem exercitationem eveniet rem non officiis repellendus corrupti reprehenderit libero laborum debitis cupiditate numquam rem ut et molestias dolores sed nostrum placeat sed doloremque ipsa adipisci quisquam quae et velit placeat velit at omnis at voluptates quia et eveniet corporis consequatur dignissimos nostrum voluptas id et qui suscipit iure blanditiis tempore quia sunt voluptates expedita sunt praesentium iste et voluptas quaerat consectetur architecto deserunt doloremque animi et earum sed necessitatibus nihil unde omnis quia impedit quia ut nemo magni fugiat nihil est deleniti saepe eligendi delectus in rerum quos aut totam ea voluptatibus sit.', '1', '2017-05-02 22:59:04', '2017-05-02 22:59:04');
