INSERT INTO `course_news` VALUES ('347', '8', 'Odio laboriosam praesentium dicta ullam.', 'Ullam alias consequatur illo consequatur doloribus corrupti soluta totam ut ab et exercitationem rerum exercitationem beatae quia velit repellendus dolorum tempora fugiat fugiat excepturi quidem quas ut numquam atque nihil perspiciatis et et ea explicabo tempora quis perferendis quo praesentium autem id est quam recusandae assumenda maiores ullam placeat nemo animi aliquid quae ut assumenda beatae non maxime optio et ipsa et magnam dicta libero exercitationem et inventore numquam dolor repellat corrupti repudiandae commodi magni at quos quisquam eaque quasi quaerat ducimus inventore magnam vitae quod quae labore autem minus sapiente quam facere non ut voluptatem modi eos eos reiciendis vel quam rerum corporis aut ut quis rem quia illum nihil vitae odio error natus iure illum dolores laborum nihil rem minus ab quis nulla aut quis nihil deleniti doloribus dolore quod quia illo ipsum nisi sed ut praesentium nihil fugit ut velit earum accusamus in sit et est voluptatibus minus quisquam laudantium rerum molestias eveniet aspernatur velit ea et omnis id doloremque quo odit voluptatem esse id aut natus atque reprehenderit accusantium quia ratione sunt aut voluptatibus eligendi qui soluta est ut in esse provident earum omnis et ullam quisquam dolores perferendis est rerum maiores rerum quibusdam quis officiis voluptatibus consectetur recusandae similique nemo doloribus impedit dolor occaecati cupiditate hic ipsa sed iusto tempore praesentium eum nobis corporis ut omnis ullam fuga iusto et cum temporibus et cumque quod qui impedit sint sequi nam corrupti enim dolores consequatur itaque quas sed omnis repellendus et optio molestias illo ducimus voluptatum possimus quia repellendus quisquam ratione vel quidem nihil voluptas alias non voluptatum quod possimus occaecati totam sed deleniti illum sed tempora velit repellat repellendus dolorem rerum quas officiis error repellat beatae eveniet