INSERT INTO `course_news` VALUES ('348', '2', 'Ipsa dolorem quia veritatis eligendi.', 'Quas est consequatur sed et voluptate architecto aut sit consequatur et ea quaerat reprehenderit facere ex ea incidunt voluptatum qui velit est et consequatur explicabo neque fuga distinctio aliquid omnis nesciunt commodi velit voluptates et quia quae odit aut ipsum nesciunt possimus praesentium aut pariatur quia odio autem sint dolorem cumque id sed eius voluptatem expedita qui sequi est autem nostrum ipsa aut consequatur adipisci sit earum officiis aliquam reiciendis tempora cum ullam numquam sequi dolorum assumenda officia hic aspernatur numquam numquam aut porro numquam quisquam quae fugiat saepe beatae eos debitis id soluta sint praesentium aliquid aliquam dolores omnis quidem vero impedit aut tempore natus quam eveniet nihil ducimus incidunt aliquam ab consequatur qui dolores architecto esse labore et et labore facilis in explicabo sed velit id autem vero voluptatem accusantium ut repellendus voluptas voluptatem qui placeat modi voluptatem alias reprehenderit placeat sunt commodi tempora reiciendis qui pariatur quisquam possimus laborum consequatur odio quo unde libero illum corrupti accusamus aspernatur dolore laborum doloremque ab eos ea est officiis quia vel error voluptatem ut ut et doloribus ad dolorem sit magni numquam optio accusantium libero dicta est maiores eum sint illo labore neque iusto aperiam eveniet fugiat magni vero et tenetur aut provident ut recusandae qui iure corrupti tempora est occaecati quod laudantium et animi ut asperiores reprehenderit laborum explicabo et maiores eos nulla eum nisi est temporibus et neque enim blanditiis porro illum doloremque aut veniam excepturi ipsa doloribus ea aut dicta sapiente omnis minima sint delectus rerum omnis totam odio in aut sint voluptatum nostrum quod doloribus quis laborum eos et doloribus dolor vero nulla architecto ab autem accusamus vero rerum autem dicta deserunt assumenda omnis ea dolores aliquam est eum be