INSERT INTO `course_news` VALUES ('351', '7', 'In sit odio eum veniam nihil assumenda id.', 'Expedita dolorem sapiente doloribus totam totam quibusdam animi eaque consequuntur numquam ratione repellat placeat autem aut eum odio eum illo quo cumque aperiam vel voluptates sit quaerat autem qui asperiores molestiae impedit magnam asperiores fuga distinctio quo sint maiores ducimus voluptates consequatur explicabo illo sunt quaerat quo totam nihil molestiae nobis sunt nobis sit odit quas et ea fugit dolores voluptatibus veniam quaerat deserunt voluptatem recusandae sunt maiores labore nihil dolore libero impedit error perspiciatis doloribus modi nemo et reiciendis cumque quia et molestiae in voluptatem neque rerum non quia id rerum voluptatem qui ut sunt beatae ut dignissimos minima sunt optio iusto modi facere quia dignissimos fugit non sit alias possimus velit atque quam temporibus sed ratione illum id consequatur non numquam voluptatem consequuntur voluptates quia asperiores velit sunt qui vel quia a quidem cumque quis aut nemo aut error quia blanditiis et aspernatur maiores maiores deleniti atque earum error ea iusto libero qui esse quia aut aut id eum occaecati aperiam voluptatem ad voluptatibus cumque quo delectus autem est voluptatem ea rerum velit eveniet autem quia quia quasi mollitia et et unde rem est odio.', '1', '2017-05-02 22:59:05', '2017-05-02 22:59:05');
INSERT INTO `course_news` VALUES ('352', '5', 'Sit pariatur provident aut et in.', 'Exercitationem molestiae repellat est ipsa ipsam ea aut earum corporis nesciunt iusto aliquid veritatis est dignissimos molestiae et neque sit quibusdam quisquam dolorem ex quis officia et fugiat porro nihil saepe fugiat asperiores necessitatibus dolorem eos veniam enim fugiat consectetur eum nihil aperiam recusandae dolores voluptas laborum vel numquam debitis et dignissimos corrupti quidem veniam sint in dolore iste quis sed et velit placeat et voluptas et ullam aut repudiandae maiores qui eveniet dolorum magni cumque dolor unde qui corporis sit molestiae ut impedit pariatur ea ab consequatur excepturi et aliquam id possimus ut ad aliquam recusandae consequatur velit numquam numquam repudiandae enim rerum ut esse quod ipsam dolores ut eos quos enim molestias soluta fuga vitae eaque adipisci nemo sunt harum non aliquid quia et esse vitae hic perferendis inventore est est omnis sunt sunt unde facilis voluptas accusamus quae sit commodi ratione delectus sint dolor nostrum officia eum quis natus neque eaque commodi veritatis omnis cumque inventore fugit qui iusto maiores atque voluptates voluptatibus et qui doloribus reprehenderit iste est necessitatibus voluptatem qui consectetur qui numquam veniam vero nulla atque rem veniam sed quaerat autem laborum quae voluptatum et est aut asperiores numquam cupiditate quisquam est dolores quasi repellendus consequatur culpa atque in eos quaerat pariatur nulla debitis ex ratione quia tempora illum dolor assumenda vel consequatur architecto magni quo qui in vitae voluptatem deleniti beatae illum quia ut quae quidem voluptates et dolorem est deserunt rerum tenetur doloribus ea suscipit iusto qui dolorem accusantium perspiciatis necessitatibus cumque eos nesciunt totam voluptate consequatur quos corrupti voluptate doloremque tempora aspernatur illum dolorem temporibus qui explicabo rerum debitis harum ex deleniti est exercitationem perferendis digni