INSERT INTO `course_news` VALUES ('353', '3', 'Qui soluta esse sapiente deleniti voluptatum neque.', 'Ipsum aliquid placeat accusamus non at nihil totam fugit cumque qui non iure quia quia excepturi blanditiis accusantium sed rerum quia sed voluptatum alias fuga harum explicabo corrupti reprehenderit est blanditiis nihil aspernatur rerum sed non exercitationem ullam dolor rerum aut non perspiciatis aperiam asperiores aut nesciunt qui aspernatur quo ullam accusamus velit ut amet odit odio ut impedit non corporis enim expedita temporibus vero laudantium neque quos earum eos blanditiis dolores quis et aspernatur reiciendis nesciunt suscipit natus id nulla quidem maxime alias eos ut et fuga adipisci ut soluta debitis ut harum quia corrupti voluptatibus placeat ducimus ea error aut distinctio ut est sed quibusdam iusto nesciunt dicta velit sequi rerum qui iure animi est eius voluptatem ipsum fuga vel sit et molestiae iure aperiam et consequatur atque aut quis debitis et dolorum esse omnis sit autem consequatur id ut adipisci assumenda ad adipisci ut repellat dolorem quod vero fugit dolore eum possimus aperiam cum voluptatibus explicabo et iste voluptatibus tempore eos molestiae est quis et quo id ut nisi nulla ullam rerum qui sunt quia autem rerum sunt qui ut odit consequuntur et sed nostrum maxime rerum est commodi rerum est id sunt voluptatibus placeat modi ducimus illo voluptate voluptas rerum et quisquam voluptatem sit quia suscipit illo ut et et nihil temporibus vel dolor cumque enim labore nulla culpa omnis totam quis sed quasi ducimus accusantium maiores quidem nihil soluta quia minima deserunt excepturi laudantium atque tenetur et voluptatem eum doloribus rem inventore consequatur non omnis aut optio quos rerum voluptatum iste quod aliquid nihil earum fuga nesciunt ipsam perspiciatis libero quam quae perferendis eaque ullam distinctio unde in laudantium.', '0', '2017-05-02 22:59:05', '2017-05-02 22:59:05');
INSERT INTO `course_news` VALUES ('354', '8', 'Dolore tenetur consequuntur perspiciatis dolores qui qui aspernatur.', 'Officia quisquam et dicta itaque quos cupiditate accusantium et dolore reprehenderit quo ad praesentium quaerat quis magnam qui aut ad rerum exercitationem in architecto sed aut eaque voluptates dignissimos culpa aut perferendis et suscipit cupiditate quaerat dolorem qui cum quas maiores omnis sit nobis architecto quisquam non earum a libero ab officia autem qui dignissimos reprehenderit voluptates neque sed est sit repudiandae facere laboriosam et hic officia voluptatem incidunt maxime soluta quas delectus quas adipisci magnam illum ad quaerat occaecati ut deserunt aut qui et facilis fugiat id rerum quia voluptatem aut atque quia id aut maiores ipsam fuga ullam quibusdam nisi est illo repudiandae nisi nisi voluptas mollitia enim impedit sequi ab aperiam laudantium ut placeat earum necessitatibus non ad unde qui aperiam et nemo aperiam in voluptatem sunt quibusdam quaerat voluptate corrupti molestiae accusamus voluptas dolorem laborum ratione architecto neque voluptates provident quaerat quidem voluptatem eum porro culpa non dolores voluptatem sunt similique est ut cum voluptates sint quidem adipisci quasi ab quos cumque occaecati repellat fugit velit qui ut et repellat rerum natus repellendus qui doloremque soluta voluptatem necessitatibus ullam fuga est illum molestiae rerum sequi aut et deserunt quod est et in nam reiciendis eveniet ut qui totam consequatur expedita suscipit consequatur laudantium perferendis quo modi minus nostrum possimus id nihil quo modi illum est voluptatibus ratione et est impedit voluptatibus iste est et molestias ipsam voluptatum cum in dolor magnam praesentium dolores reprehenderit totam voluptatum molestiae impedit odio sunt iste nesciunt ex quia ipsum et tempore in et est quibusdam reiciendis dolorem qui voluptatem sit et magnam assumenda voluptatum quo possimus ea quis autem excepturi quam aut magni non perspiciatis e