INSERT INTO `course_news` VALUES ('361', '9', 'Architecto et adipisci cupiditate aut aut.', 'Non alias ratione itaque at voluptas explicabo exercitationem similique quia sapiente et vero omnis minus accusantium distinctio voluptates alias et debitis ut magnam necessitatibus quo aliquid iure similique iure natus tempore ut debitis vitae eaque non et dolorem non quam ut rem qui fuga necessitatibus ipsum beatae reprehenderit soluta ut quam accusantium quo quis reiciendis ullam voluptas occaecati ea earum fuga deleniti architecto earum numquam quia dolorum voluptatem dolorem eos nostrum qui et sunt non atque atque omnis illum exercitationem sit veritatis eos ipsa est veritatis amet maxime eaque numquam explicabo voluptas voluptate velit quia voluptatibus et quis cum sed id atque suscipit reiciendis esse quod molestias aliquid eaque eos sunt ea nam ut aliquam voluptates qui rerum qui alias tempore unde incidunt saepe ipsam praesentium tempora sunt soluta aut voluptatem beatae sapiente omnis corporis cumque possimus esse vel sequi in id perferendis nobis beatae eaque velit nesciunt alias debitis aliquam aspernatur explicabo quas explicabo recusandae laudantium velit impedit eos ut et placeat voluptatum consequatur voluptas consequatur distinctio velit aperiam necessitatibus repudiandae esse ipsam omnis voluptate vitae at et ut illum sed assumenda libero culpa nostrum fuga molestiae et sed saepe minima autem quidem sunt eos rerum voluptatem repudiandae ipsa est quasi et et totam aut explicabo cumque nobis quo dolore illum est et.', '1', '2017-05-02 22:59:05', '2017-05-02 22:59:05');
