INSERT INTO `course_news` VALUES ('366', '6', 'Id placeat non quia voluptatibus culpa tempore.', 'Id a voluptatibus nihil provident amet rem et non commodi facilis magni odio voluptatibus ut itaque tempora laudantium animi saepe pariatur animi quis consequatur pariatur est dolores nisi possimus et libero ut architecto quo ut laudantium non deleniti adipisci officia nisi magni voluptatem praesentium ut doloremque commodi animi reprehenderit asperiores dignissimos voluptatibus voluptatem unde praesentium veritatis placeat impedit autem harum voluptates voluptas quia eum velit unde odit consequatur reprehenderit atque consequatur voluptatem sit similique blanditiis expedita deleniti aspernatur minima saepe consequatur est nobis quia totam aut et possimus libero non voluptatum repudiandae dolores at aut molestias libero ex consequatur vel pariatur ea corporis qui qui est labore magnam debitis nihil iste explicabo accusamus perferendis aut molestiae culpa facere repudiandae eos vitae id esse assumenda et optio dignissimos commodi et fuga excepturi dolorem non et impedit quis rerum distinctio porro maiores veritatis ipsa explicabo iure porro et atque provident temporibus dolores doloremque eveniet earum iste maiores labore qui nemo beatae qui aut consequatur sed nostrum voluptatem beatae culpa eos accusantium odio quos eaque voluptas consectetur incidunt omnis autem unde consectetur earum iusto vitae ullam cumque illum quia et laboriosam nesciunt aut ullam non sequi ad assumenda cupiditate modi rem eligendi labore corrupti corrupti ut iusto nemo numquam quod nam voluptatem delectus inventore voluptatibus nihil occaecati voluptate et sit quia quia ipsa perspiciatis ipsam nihil amet similique odio voluptate earum veritatis et deserunt ex molestiae et eos consequatur totam nobis voluptas quis et sunt placeat aut non nam quod tempore alias autem cumque eum atque reiciendis et beatae quo repellendus eveniet neque rem qui sint sed ipsam rerum fuga tempore voluptate mollitia ape