INSERT INTO `course_news` VALUES ('367', '3', 'Harum est porro qui et sit atque.', 'Aut velit autem error facilis asperiores commodi qui rerum voluptatem odit maxime quo fugit sit minima non maiores aperiam quos consequatur eos est ut facere nam ipsam in quia similique libero quod nulla adipisci eum quo minima esse sit ullam consequatur atque a sint est deleniti qui nesciunt dolor in inventore quam quia alias quos eaque porro consectetur ipsam non quidem sed beatae natus suscipit sed voluptas velit quod est neque quia consequatur necessitatibus a et aut porro quasi repellendus corporis vel alias et asperiores officia aut delectus id explicabo accusamus repellat illum minima hic ipsum aut natus maiores accusantium iusto laboriosam omnis non aspernatur repellendus suscipit nobis animi necessitatibus tempora modi dolores aut vitae qui aspernatur aut et vitae adipisci tempore eligendi consequatur architecto consequuntur consequatur eaque dignissimos ipsum sunt aut et nostrum dolorem quaerat et minus fugit ut qui itaque aliquid labore eveniet deleniti odio ad numquam deleniti illum repellendus cumque sed tempore officiis veniam iusto aut laborum nulla autem nobis fugit aut velit et commodi et possimus eum ut dolore velit ut animi velit consequuntur magnam aut vel necessitatibus nihil vel id eum ea ratione quae aut consequatur quaerat quia eum in non nihil quisquam temporibus dolore amet ducimus voluptatum occaecati velit aliquam quo quas autem est ducimus quaerat repellendus dolorem aut sunt amet illum et cumque sapiente facilis qui eligendi consequatur repellat iure maxime vitae molestiae repellendus aliquid sapiente beatae nihil repellendus quasi incidunt accusantium et voluptatibus harum amet eligendi repellendus accusantium non sunt ad dolor officia necessitatibus quidem officia quia incidunt neque minus ab nam adipisci aut cum numquam tenetur sapiente accusantium facere ducimus culpa perspiciatis in possimus voluptas sit voluptas quidem omnis dolorem sit iste quis commodi voluptatum nihil ipsum reiciendis quis vel molestiae voluptatem perferendis impedit deserunt et tempore ipsam omnis beatae non aut eum fugit consequatur qui deserunt nobis quas ad qui sit vel rerum quos eligendi voluptas qui similique qui cupiditate est sint est fugiat numquam vel quam et consequatur ratione et deleniti voluptas autem quia omnis nobis numquam et fuga beatae blanditiis ratione facere quisquam voluptatibus quisquam dolorem ut sint adipisci veniam aut adipisci et quia nulla architecto ullam et illum incidunt placeat vel non occaecati nihil quasi aliquid provident rerum aperiam quis sit recusandae et nam eveniet aut ad et et corporis maxime molestiae laboriosam quos quibusdam maxime ut placeat fugit libero ut est non provident et eius earum libero distinctio aspernatur excepturi dolorem doloribus id cumque ad rem rerum adipisci aut sapiente temporibus vel quae eos.', '0', '2017-05-02 22:59:05', '2017-05-02 22:59:05');
INSERT INTO `course_news` VALUES ('368', '7', 'Aut distinctio inventore repellendus et voluptates.', 'Commodi itaque sit deserunt nihil nam provident nihil velit ut minus iusto voluptas omnis qui minus omnis voluptatem atque iusto aut facilis vel cumque expedita optio rerum earum omnis vero qui beatae molestiae atque ducimus rerum voluptatem doloremque aut aut voluptatibus nisi repellendus illum adipisci neque non tempore non eaque voluptas voluptatum et dolore maxime nihil quia voluptatem quam esse unde quos omnis magni maxime maiores est aperiam omnis et consequatur vel eveniet et laborum aliquid reprehenderit iure esse aperiam blanditiis magni iusto dicta voluptatem adipisci earum fugiat unde perferendis ipsam repellendus nesciunt aut est ut eligendi cum ipsum cumque exercitationem eveniet sunt sit rerum consequatur hic cupiditate ipsum et ut tempora praesentium quia nostrum recusandae consequatur accusamus officiis assumenda recusandae aspernatur omnis ut autem qui tempore sed repellendus neque dicta similique suscipit fugiat aperiam repellat ipsum vel sed temporibus repellat nihil totam atque fugiat vitae sunt fugit ipsum est vel quia dolores quos non reiciendis atque unde quia nulla est illum laboriosam aut dicta at minima accusamus et blanditiis neque temporibus itaque molestiae totam quod est et aut dolorem ex qui laborum assumenda et corrupti reprehenderit eaque tempore sed excepturi corporis atque blanditiis eligendi in tenetur dolorem non ipsam quaerat est et quibusdam delectus placeat architecto ea distinctio repudiandae rerum dolore officia praesentium sit explicabo ut similique temporibus quaerat totam cumque a cumque laudantium corrupti voluptate aut sint cumque perspiciatis quia deserunt maiores voluptates ratione repellendus aut qui voluptate quasi est repudiandae fugiat architecto eos est magni ratione excepturi debitis itaque asperiores similique mollitia eveniet facere earum voluptas iusto cupiditate voluptas neque ea sed iusto delectus architecto sit non ut cum modi aspernatur ullam assumenda dolores aut sunt ea et inventore dolorum deserunt sunt dicta consequatur incidunt consequatur dolor nemo fugit voluptatem accusantium eos necessitatibus cum aut soluta totam quaerat est delectus veniam eos laudantium voluptate iure ducimus harum voluptatum dolor et fugit quidem ut corrupti aut sapiente quidem est voluptas facilis et quas dolor dicta unde illo vero laborum sunt reprehenderit sed.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('369', '3', 'Esse voluptatum iure et asperiores beatae.', 'Nemo pariatur voluptates mollitia qui magni in minus voluptatem fugiat ut voluptatum aut enim non fugiat doloribus sint reprehenderit explicabo itaque perferendis est repellat ab excepturi temporibus sit sed aut dignissimos fugit voluptatibus mollitia quasi ratione voluptatem consequatur illo reiciendis modi iure sequi laudantium ab doloremque at quasi dolore sed a facere aut sed vero reiciendis rerum earum autem ut delectus dolorem consequuntur ut numquam voluptatem aut ut quia nihil consequuntur molestias voluptatem voluptatem totam eos omnis aut quia tempora est ad sint quia sunt blanditiis ex alias a non quia et reprehenderit numquam consequatur alias eveniet aut harum eius ut id et sequi laudantium magni accusantium perspiciatis sunt quia debitis assumenda adipisci perspiciatis non molestiae suscipit voluptatem enim rerum et reiciendis minima atque ut quo laboriosam doloremque ut impedit est vel dicta corrupti sunt qui qui rerum dignissimos odit sunt aliquid nihil harum quod inventore labore voluptatem consequatur minus harum pariatur aliquid possimus minus unde natus voluptate minima vel eius placeat voluptatem voluptatem quod labore nihil optio facere illo corrupti cupiditate in quam illo qui est distinctio dolor consequatur sunt cumque consequatur voluptate pariatur maxime fuga molestiae et impedit quis rerum odit facere eum consequatur deleniti alias tenetur eos accusamus et a consequuntur doloribus corporis sed debitis voluptatem quam ut ab quidem sapiente quis quam porro architecto consequatur id fugiat harum sit voluptatem officia consequatur illo ullam exercitationem esse quas delectus est incidunt dolor vitae mollitia laudantium et ea facilis repellat similique ratione doloribus consequatur quas est dicta et repudiandae consequatur neque dolorum id qui molestiae in sed repudiandae sed et qui ex voluptatibus aliquid hic ut fugiat provident sequi est ex aspernatu