INSERT INTO `course_news` VALUES ('370', '2', 'Voluptas eum magnam veritatis magni est.', 'Minima nostrum tempora animi neque tempora impedit nemo error reiciendis culpa blanditiis soluta provident qui omnis ullam eligendi perferendis incidunt enim neque qui enim vero placeat sit blanditiis velit dolores autem quod quia maiores adipisci rem et laudantium tenetur et architecto nihil quasi qui aut velit consequatur temporibus enim est vero qui libero optio magni voluptatem reprehenderit unde unde dolores et optio ab non debitis sed dicta quae sequi porro sed repellendus praesentium sit autem modi illum molestias ab neque qui eum nemo sit assumenda eum omnis quis pariatur laboriosam corrupti omnis numquam qui nesciunt non nam fugiat aut reprehenderit ad enim ut odio amet cum nostrum ut aut modi vitae odit et dolor dolorum est neque aut qui molestiae reiciendis dicta consectetur quia vitae rerum sint nihil aliquam beatae maiores quia ipsa assumenda et repellendus hic in explicabo sed repudiandae doloremque minus aut aliquid et repellat aliquid corporis dicta occaecati ut voluptas quo fuga omnis eveniet velit deleniti est corporis nesciunt repellendus beatae omnis eum ut tenetur deleniti eos itaque eos non dolor necessitatibus quo debitis ut corporis modi veniam labore qui illo adipisci voluptas eveniet perspiciatis odio hic recusandae error suscipit quo vel esse.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('371', '1', 'Ut consequatur culpa voluptatem eaque iste est recusandae.', 'Nesciunt consectetur et esse eos nihil maxime rerum nobis tempora ut et repellat ut recusandae facere veritatis qui soluta sed voluptatem non esse sint sint reiciendis et impedit modi repellendus ipsum deserunt ut dolorum ut porro qui autem consequuntur autem nulla aliquam aut dolorem quaerat sapiente veritatis et nostrum et harum repellendus amet repellat nam optio deserunt et repellendus aut doloribus magnam excepturi nemo iste reiciendis ut recusandae ad fugit facilis quam perferendis sed ea eligendi dolor et natus sunt autem quibusdam unde consequuntur non et totam adipisci debitis repellat omnis velit dolores et doloremque occaecati reprehenderit tempore numquam nam accusamus sequi nesciunt voluptas voluptas omnis sed ducimus sapiente omnis enim et dignissimos voluptas ipsum assumenda nobis fugit qui nisi fuga eaque saepe voluptas maxime doloremque autem enim voluptatum autem iure in qui est dignissimos doloribus nesciunt nostrum eligendi blanditiis temporibus ut sequi fugiat voluptas qui ullam ipsa ullam voluptates nulla qui laudantium amet quis consequuntur laudantium est rerum assumenda occaecati iusto ut aliquam labore autem unde voluptate assumenda excepturi dolore laboriosam deleniti sequi quia soluta accusantium aut aliquid voluptatibus accusamus ullam sed molestiae minima quo sint consectetur eius praesentium et voluptatem rem quibusdam veniam aut perferendis sint quod omnis incidunt qui et tempora et id qui eius quia saepe ut veritatis voluptas dolorem beatae ipsum quaerat suscipit totam dolores nam tempore iure ullam architecto quia odio cupiditate maiores quas exercitationem dicta est quia et minus sed voluptatem repellat veritatis consequatur est qui iste blanditiis et fugit consequatur consequuntur veritatis minus laboriosam ut facere eveniet cupiditate blanditiis id corporis quo explicabo id voluptate quo pariatur corporis aliquid dolore te