INSERT INTO `course_news` VALUES ('372', '5', 'Eos eum consequatur facilis est.', 'Neque incidunt quam dignissimos error voluptatem ipsam optio ullam et minus deleniti aut cumque qui velit et enim natus quia non accusantium sunt non cum natus accusamus consectetur qui saepe voluptatem assumenda quis ea cum ratione facere voluptas aut in qui eligendi architecto ut occaecati corporis aut praesentium deleniti quaerat aut fugiat nulla quo in praesentium doloremque voluptatem ut corrupti pariatur voluptas laborum est ipsam quis optio voluptatem eum ex officiis quia inventore sint repellat iste iure nemo dolor saepe dolor voluptas asperiores qui id dolor saepe sequi provident nihil voluptatum corporis aut adipisci aut et enim est labore consectetur deleniti odit quidem consequuntur minus et non ut et consequatur vel atque dolorem sint blanditiis ut eos ut modi consequuntur quaerat totam voluptas velit necessitatibus nobis et sit accusamus vitae in dolorem reprehenderit fugit totam repellat voluptates et minima et aut dolorem ipsa quis eaque voluptate aut voluptatibus iusto sed magnam id consequatur hic est aut repellat soluta odio est nisi in doloremque et vitae facere ea dolorum est ullam atque quod magnam aut a illum ratione et nulla consequatur non omnis optio ut illo quo non qui unde quod rerum maxime ratione laudantium ipsam commodi porro qui repudiandae voluptas qui recusandae illum facere ut cum dolore repudiandae et perspiciatis neque eos dolores repudiandae perferendis aliquid iste temporibus consequatur totam ab maiores sit non ut accusamus autem veritatis qui libero alias dolores quis nisi quasi est nihil doloribus quis pariatur possimus incidunt sit aut hic magnam officia voluptas at velit sit eum quis ex voluptatem beatae fugit consequuntur quo saepe tempore provident laboriosam adipisci reprehenderit ipsum vitae labore distinctio rem consectetur aperiam dolorem repellendus sit quia est deleniti et maiores consequatur qui laborum nihil doloribus nam earum odi