INSERT INTO `course_news` VALUES ('373', '3', 'Officiis accusamus ullam est.', 'Corporis qui est repudiandae occaecati et temporibus est facere ut nemo ut aperiam voluptas et mollitia consequatur autem alias labore sequi eius culpa voluptatum aut molestias est ea saepe laudantium atque eum aut doloremque vel nihil nobis nihil cupiditate ut ab omnis error aliquid maiores dolore ipsa quaerat similique qui quo aut qui sequi quasi ipsam quasi necessitatibus ipsam laudantium ea sit dicta itaque odio maxime aperiam aliquid dolores recusandae voluptatum aspernatur velit exercitationem molestiae vero unde dolores in ea eius officiis et rerum ducimus vel delectus dolorum voluptatem aperiam mollitia quasi sed magnam provident voluptatem omnis amet quae totam quia nihil aut labore sapiente iste et et sint nostrum deleniti vero culpa doloribus quo eos et quibusdam sit officiis et deserunt ea et eum ducimus consectetur et pariatur rerum nihil minus repellat asperiores enim cupiditate id sit quam quas soluta cum harum architecto fuga ipsa ut facere enim rerum ad aut et consequatur ut cum non maiores eum dolor autem sit in iure omnis eaque explicabo repellendus reprehenderit molestiae aut vero aut aut voluptatem sunt occaecati et molestiae itaque ex eos exercitationem laboriosam autem eligendi aliquid expedita similique quia quod minima error in ut quo porro excepturi in vel sint ratione repellendus perspiciatis eos harum minus sint accusamus aut aut velit inventore laborum est quo nesciunt sint enim autem recusandae quasi est officiis omnis mollitia commodi sit aut magnam asperiores laboriosam sit atque nulla numquam nobis at corporis nemo vel laudantium soluta voluptatibus laudantium non expedita laborum ut voluptas ea voluptas consequatur vero dignissimos doloribus minus et dignissimos fuga totam ut error facere et minima animi voluptatem doloribus rerum odit qui deleniti qui unde repellat dolorem hic sint soluta ipsa enim minima tenetur in illum tempore rerum aut quos corrupti