INSERT INTO `course_news` VALUES ('374', '1', 'Accusamus quidem numquam et voluptas.', 'Repudiandae molestiae voluptate ipsa tenetur qui corporis architecto et non iste ex saepe dolorem quisquam porro odit veritatis culpa et ut recusandae id enim nemo at veritatis ad in veniam sed dolor debitis rerum commodi quidem est qui voluptate pariatur recusandae porro itaque sint atque error adipisci nihil non reprehenderit vitae consequatur officiis ipsum necessitatibus neque omnis ipsa fuga praesentium impedit eaque voluptas nisi reprehenderit ut inventore doloribus consequatur sint et quas et non modi architecto dolorem consectetur consectetur laborum id minima deserunt harum et aut commodi eum tempora sed quia iure architecto animi id repudiandae et ipsam ipsa aut et similique aut maxime iste et est porro molestiae molestiae id explicabo sint ab quidem harum doloribus vero ea perspiciatis ad iste eos et rerum non aut delectus ut consectetur animi alias praesentium impedit sint vel quia enim velit adipisci temporibus praesentium et officia autem et quod eos rem et enim impedit aspernatur ipsa amet quas quo eveniet similique quibusdam harum reprehenderit suscipit pariatur neque dolores enim quisquam sunt facere et consequatur sit ab nesciunt iusto ut dicta nostrum expedita similique et occaecati ut quasi voluptatem unde eius minus laboriosam quidem repellendus officia et soluta autem dolor omnis voluptatibus dolor omnis ipsam voluptas aut provident repudiandae cumque consequatur molestias qui fugit doloremque cum sequi ut voluptatem architecto rerum veniam est eligendi ut delectus commodi cum dicta id accusantium facilis dolores mollitia consequatur ea aut veniam cupiditate et aut dolor architecto vitae quo corporis distinctio praesentium laborum voluptate id mollitia illo veritatis deserunt consequatur iure qui inventore iure incidunt distinctio veritatis assumenda sit placeat qui ut aut eum fuga facere illo aliquid aut sed reprehenderit ut deleniti voluptates aut recusand