INSERT INTO `course_news` VALUES ('375', '6', 'Explicabo impedit omnis repudiandae nesciunt possimus in dolorum.', 'Officiis recusandae accusantium dolore voluptas qui quaerat molestiae fuga beatae qui quia quia sed ipsa doloribus laboriosam voluptates tempore est dolorum sint tempora qui sunt nostrum quis tempora dolorem delectus omnis harum non odio consequatur ex quam ipsa rerum ipsa qui ut quia praesentium quae necessitatibus occaecati corporis ducimus possimus ea ut tempora facere praesentium sunt et sint ab et iusto ut ex nihil aliquid aliquam illum ex voluptas ipsa dolore explicabo aliquam accusamus maiores quis voluptatibus eum dolorum reprehenderit amet vero velit iste nulla minima omnis non quibusdam qui vitae sequi hic nostrum nisi quia consequatur unde fuga qui est quos aperiam reprehenderit non unde sed atque qui consequatur dignissimos consequatur tempore dolorem iusto earum fugit neque aspernatur exercitationem laboriosam sint enim distinctio excepturi aut et distinctio perferendis qui temporibus aut repellendus nulla quisquam quis eos quae velit distinctio et sit repellat nesciunt porro et vitae voluptatem quibusdam sint facilis nihil voluptatibus vero quia nesciunt odio et aspernatur autem quod est possimus consectetur labore voluptatibus qui voluptatibus et mollitia repudiandae mollitia modi alias suscipit rem hic harum repellat iusto quos non at itaque error dicta nobis deserunt impedit id enim ex quas aut officiis et et totam quia doloribus et quo enim suscipit cum distinctio voluptates perspiciatis dolor id dolore vel commodi ducimus saepe quia reprehenderit consequuntur aut nulla error impedit et modi dolor et ut eos alias quasi beatae ut saepe iste doloremque assumenda et placeat qui a molestias sit accusantium occaecati deleniti est nihil aut qui dolore aliquid aut qui ullam quidem vero sed delectus explicabo et labore omnis magnam voluptatem et dolorum quibusdam repudiandae amet labore eum placeat quo esse voluptas tempora voluptatem laudantium qui dicta temporibus laudantium doloribus quis ipsam doloremque expedita id et consequatur ea corporis dignissimos sed distinctio ipsa vel dolores quo nemo numquam doloribus veniam alias omnis ad ipsa quia veniam rem non voluptatem blanditiis excepturi ullam culpa labore rem labore quam praesentium consequatur.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('376', '8', 'Quam quia earum suscipit consequatur hic non.', 'Magnam voluptates doloremque nulla beatae optio ut qui enim aut ullam nesciunt sed reiciendis ut deserunt nam aut eligendi eveniet ipsa sed et est voluptas quas rem ratione voluptas cupiditate aspernatur consequuntur explicabo est quisquam commodi voluptas ea cum consequatur officiis quod et aspernatur illo natus sunt rem magnam nisi doloremque quod inventore deleniti et minima nam eius quisquam aut quos ut et amet repellendus sequi ipsa explicabo debitis aperiam vel dolorem ut molestiae odio quia distinctio culpa vero tempore earum sint expedita nostrum ab dolore suscipit iusto maiores quo molestiae possimus est ut sunt rerum ipsam sunt et aut et totam at enim dolor eos ullam dolore asperiores in provident fugiat maiores excepturi fugiat voluptas vel pariatur voluptas doloribus eum voluptatem voluptas voluptatum itaque architecto et nam est rerum explicabo ut et consequatur et rerum sunt omnis qui vitae sint eos quam ipsum dolor qui in est id consequatur quia aut sit qui est nam voluptatem vel omnis perferendis aspernatur nobis placeat et beatae nobis sit veniam iste eveniet non et earum dolor reiciendis amet itaque labore fugit eius dolorum sit aut accusamus natus doloremque iure possimus qui iure eos neque accusamus fugiat sed earum recusandae aut quia exercitationem corrupti illo magni eveniet in laboriosam vitae quos esse nulla quisquam in eaque sint quo incidunt consequuntur odio est minus eum reiciendis voluptatem magnam a perspiciatis harum sint quis voluptatum molestias laboriosam corporis iure fugiat perspiciatis et laborum consequatur iusto vel necessitatibus dolorem hic sequi sint voluptate dicta explicabo facere aut dolore et rerum sed eius voluptas dignissimos omnis et quis ut.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('377', '8', 'Et magni nihil rem aliquam.', 'Soluta dignissimos quasi nihil excepturi omnis quibusdam autem deleniti consequatur odio non id est nulla qui minima ut voluptatibus sapiente iusto excepturi harum eveniet eveniet ut non corporis ea beatae est rerum iusto asperiores fugiat voluptatem et cum ea qui excepturi quae cumque officiis eligendi et quo recusandae est quasi libero dicta sint delectus possimus veniam occaecati maxime sunt iure quisquam quis modi dignissimos laboriosam vitae perferendis sit fuga sit ut fugit voluptatibus ut nulla rerum vero dolores facere a alias cum aut a quo natus saepe ducimus dolor sint itaque incidunt doloremque corporis esse non exercitationem ab ea illum non corporis nisi provident ut itaque molestias iusto tenetur est beatae a inventore consequatur saepe placeat est aspernatur dolor atque et nemo enim magni nihil molestiae consequatur sint ut vel officia qui doloribus sit earum dolor voluptatem omnis et cupiditate eligendi doloremque qui quo architecto dolorem quibusdam doloribus placeat molestiae cum et natus voluptas et nam odit quidem mollitia reiciendis minima ducimus aut et qui aut tenetur error reprehenderit ea dolor tempora quia sequi ut consequatur dignissimos magni amet mollitia qui sapiente quis numquam et quaerat hic fugit qui cumque quasi quia atque eum architecto voluptatibus animi est similique debitis accusamus qui minus voluptatum laboriosam dolor velit nostrum et fugit numquam atque quos reprehenderit blanditiis asperiores culpa quisquam cupiditate sequi consequatur id atque eos nam facere voluptate voluptatibus sunt quod quo quia et vel et aut aliquid aut voluptates optio consequatur architecto iure aperiam ullam et illo placeat necessitatibus possimus possimus libero rerum itaque provident quia a consequatur sapiente fugiat ea nihil eius quaerat laborum libero earum qui dolore ipsa ut quam est dolorum architecto ut iusto nemo voluptates tempore quasi labore dignissimos aut r