INSERT INTO `course_news` VALUES ('378', '2', 'Sunt totam error perferendis recusandae.', 'Fugit quaerat cumque dolorem et eos aut ipsam voluptas ut provident et earum dolore quas sit repudiandae et quibusdam at sunt et iusto dignissimos qui ex magnam delectus non adipisci animi quia saepe cupiditate et provident aliquid qui voluptate laborum expedita rerum magnam in ducimus officia hic debitis accusantium facilis facere quia dolores ipsa sit ipsum magnam excepturi quod non suscipit voluptas consequuntur aut iste id sequi sed autem ducimus veniam et tempora ut temporibus eaque eius corporis ipsa adipisci voluptatem vel dolor minus non qui facilis adipisci est itaque ut deleniti id et quas dolores ea maiores ut rerum omnis mollitia molestiae facere impedit mollitia est consequatur quidem quia molestias eum perferendis ut alias consequatur fugit doloribus ipsum veniam error itaque dolores est aut magni et voluptatum necessitatibus ullam expedita voluptate et velit non ducimus possimus deserunt aut necessitatibus voluptatibus voluptas voluptatem consequuntur commodi et accusamus amet iure dolores et ipsum nisi expedita repellat tempore qui eligendi magni non et voluptatem labore consequatur quod expedita fugit ducimus nemo occaecati alias sapiente soluta nesciunt neque suscipit quod dolorem veniam cumque aut vero hic quo quisquam rerum laborum voluptatibus sit nostrum recusandae consequuntur molestiae eaque qui reiciendis non nulla provident iste qui ipsa cum aut fuga illo officiis officiis cumque at totam voluptatem architecto sed deleniti ratione ea nihil consequatur vitae dolores consectetur est quia fuga officiis iusto porro quo molestiae sunt omnis harum id rerum voluptas molestiae ut sed iusto quia ut est qui corrupti maiores animi molestiae et non alias magnam provident.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('379', '2', 'Qui molestiae quia sit hic beatae.', 'Nesciunt laborum voluptatem nam nihil non iste pariatur suscipit est odio eum qui est sed molestiae et occaecati ratione eius explicabo molestias voluptatem quaerat consequatur dolorem cumque ut est ut dicta fugiat dolorum quisquam qui recusandae dignissimos sunt aut sapiente nostrum non reprehenderit praesentium quasi et sed rerum quia saepe molestiae provident cupiditate hic illum iure est et hic ab mollitia magni saepe velit error deserunt sint doloribus recusandae dolore quos et nam sed minus qui autem velit autem quo nobis quas a rerum et nihil repellendus est minima iste sapiente dolore rerum vitae optio laborum vitae aliquid voluptas consequatur ut magnam nesciunt tempora maxime et itaque et eum iure sed facere neque rerum tempora est aut doloremque impedit et impedit repellendus quo expedita soluta fuga adipisci suscipit sint dolores et tempore beatae corporis alias ut et veniam sit accusamus est debitis eum aut ipsa dolorem odit maxime voluptas culpa aut vitae sequi quibusdam et corrupti ipsum non aspernatur reiciendis sint occaecati illum architecto blanditiis non sint vitae sed dicta quidem quasi at sit qui dolores est unde molestias non alias beatae ipsa aut dolore culpa vel reprehenderit distinctio et iste quae et quaerat expedita voluptatem aut minima officiis mollitia placeat quas pariatur cupiditate labore ea labore aut beatae itaque fugiat minus ea maiores unde ut debitis unde qui molestias consequatur ea voluptatum quia vitae veniam repellat id doloremque nam possimus rerum ratione eum accusantium ut et ut quis nostrum a facilis est sed dolorum tempora enim beatae totam dicta.', '1', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('380', '7', 'Odit perferendis quibusdam tempore reprehenderit.', 'Nesciunt tenetur quod et repudiandae beatae ex et itaque in a quia qui aut numquam in deleniti mollitia quasi culpa dolore aspernatur repellat doloribus provident ut maiores minus architecto ut id aperiam ducimus est corrupti itaque accusantium eum dicta fugit minus veritatis qui est qui repellendus facilis cum quaerat ea ullam ut quis temporibus fugiat qui accusantium exercitationem est corporis ut in autem sint qui qui nemo doloremque molestiae eius fuga aut ut error impedit omnis a enim quibusdam ut nulla nihil pariatur rerum quis qui magni optio est veritatis corrupti voluptatibus illum hic voluptatum voluptatum sit molestiae cumque illo voluptas repudiandae excepturi et sit omnis repellendus dolorum sint eum corporis voluptate vel animi recusandae dolorem odit enim doloribus qui recusandae error fugiat eos corrupti reprehenderit sit officia laudantium vero saepe itaque eum libero eos incidunt tenetur aut saepe ut quas laborum amet ad veritatis ex ea at commodi quae exercitationem explicabo quis quam est dolor ullam atque pariatur voluptatem incidunt ratione sit omnis ab aut blanditiis temporibus velit consequatur aut distinctio necessitatibus in aliquam accusantium dolor labore omnis modi illum nihil fugiat omnis odit ut est est occaecati eius ab reiciendis nisi accusamus nihil vel in enim dolor omnis fugiat asperiores sint velit blanditiis excepturi voluptas voluptatem quidem corrupti dolore molestiae nisi aliquam beatae magnam sit eligendi vero voluptatem quos minima qui odit sint nostrum eveniet ut minima aut voluptas et illum tempore ut natus eos consequatur ut deserunt nobis modi quos repellat corporis iure eligendi et veritatis consequatur facere repellendus quia cum voluptas deserunt accusamus debitis vel fugiat non voluptatibus sit voluptatem animi eligendi alias ducimus quis enim quam sed omnis magnam voluptatem quia rerum repellat odio ex dolores magnam