INSERT INTO `course_news` VALUES ('381', '6', 'Ea magni est ab consectetur odit dicta delectus.', 'Numquam facere voluptatibus dolorem aliquam omnis voluptatem animi aut molestiae repudiandae non ducimus eius tenetur maxime animi rerum repellat commodi natus aliquid harum maiores voluptatem cupiditate neque est enim quas quia enim deleniti recusandae possimus aut veritatis reiciendis eum culpa eaque ipsam aspernatur nihil eligendi enim voluptatum consequatur optio ut quae ipsam quasi laudantium voluptatum magni eligendi numquam illo deserunt et fugiat iste sit itaque et dicta occaecati asperiores corrupti sunt consectetur quis unde dolorem cum nihil numquam asperiores quia voluptatem velit nihil quod veritatis assumenda ipsum qui ut repellendus architecto aut temporibus dolores quasi dolor molestiae illo deserunt mollitia nostrum distinctio dolorum et harum vel ex natus fugiat voluptas et cumque maiores sint corporis ea rerum voluptates eligendi tenetur nihil eaque aut aliquid omnis omnis sed blanditiis magni et voluptatibus optio perspiciatis aut aperiam quia non sunt nisi assumenda maiores quia vitae labore dolor et eum consequatur deserunt ea rerum nobis doloribus magnam eveniet nam eos rerum asperiores vel quam provident et et eaque blanditiis unde vero ut cum sapiente ipsa excepturi voluptatibus at in consectetur iste ut tempore rerum accusantium quasi est aliquam sunt vel qui eum quibusdam et velit laborum dolor dolores ut facilis officia et fugit rem at.', '1', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('382', '5', 'Voluptatem minus dignissimos ut blanditiis temporibus repudiandae.', 'Nihil et rerum qui nihil molestias esse asperiores tempora excepturi deleniti sit reprehenderit dolorem facilis sapiente quo praesentium optio tempore quis fuga sint sit ab ea tempore recusandae quam nisi quibusdam est saepe vel recusandae unde sed repellat alias ut dolores accusamus doloremque tenetur et architecto eaque qui et ullam molestiae repellendus eligendi vero labore praesentium est quos animi numquam eos minus recusandae inventore consequatur eveniet autem enim et dolorem expedita eius autem aut dicta omnis quia autem fugit molestiae porro autem cumque est animi asperiores aliquid voluptate animi doloribus eos natus animi corporis eligendi similique accusantium nostrum iusto et enim enim veniam commodi magni similique molestias rerum rerum aut possimus vitae dolorem quos illo dolor minus dolor deserunt id ut omnis harum ipsam voluptatem voluptatem quam fugit voluptatum eligendi voluptatem reiciendis dolores sunt sit non nulla sit quia et placeat ducimus nemo voluptatem rerum fugit incidunt molestiae sit rerum suscipit odit quod consequuntur aliquid quasi dolore fugit excepturi et omnis rerum ea ducimus unde omnis itaque eveniet sequi ea pariatur ut et illo consectetur iste dolor cum cum alias dignissimos blanditiis commodi iste facere quam qui pariatur quam qui et labore deserunt et accusamus qui iusto possimus ipsam autem hic aut blanditiis cumque et atque et mollitia voluptatum pariatur culpa numquam necessitatibus distinctio quis cumque deserunt dolor dolorem et quia dicta quasi rerum consequuntur totam non voluptatibus molestiae qui omnis soluta quod saepe error dicta id iure aperiam aspernatur ratione dolore occaecati beatae facere qui aut eos et vero expedita quam eos qui dolorem vel aut ex et est expedita quam id consectetur dolorem consequatur error iure dolorem enim est culpa architecto id suscipit expedita et dignissimos exercitationem qui quos necessitatibus expedita facilis maiores ut nulla facere odit non reiciendis alias autem et in quia ad recusandae quod qui et blanditiis expedita quibusdam nihil inventore odio reiciendis voluptatum ullam occaecati dolorum iusto accusantium autem tempore consequuntur quia ab odio ut est nulla assumenda repellat provident eaque molestiae illo velit eligendi unde dolor nihil molestiae amet eum nam numquam debitis consectetur aut ut vero beatae earum omnis et vel quo quam eius et minima praesentium sit aliquam iure debitis porro velit odio suscipit optio culpa sunt tempore omnis ea at quo sequi quia reprehenderit veniam ea qui odit voluptates ab fugiat quod nobis magni enim.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('383', '6', 'Corporis consequatur sed voluptatibus ullam quod fugiat ut.', 'Mollitia ipsa odit eveniet saepe dolor minima sunt quia delectus eius sed recusandae est nisi laborum dolore minus sed ea atque quia est praesentium eveniet omnis mollitia aliquid nihil sunt quam debitis recusandae ut iure et nam velit architecto dicta accusamus sunt repellat libero qui repellendus amet quia assumenda et aut recusandae quod quo nobis non odit dolores ad ipsum enim atque facilis qui et odit quas rerum sit sapiente minima minus est nam aut magnam dolores animi eos qui voluptatem qui rerum harum voluptate excepturi et velit amet asperiores pariatur dicta ducimus accusamus sint dolor perspiciatis officia excepturi architecto impedit sit ipsam voluptatem et atque neque molestiae sed et consequuntur ut eaque esse error adipisci a tempora et ex quia ipsum delectus explicabo dolor esse iste ut laudantium accusamus et accusamus et alias aut recusandae itaque officiis deleniti aspernatur vel alias fugit et perferendis aliquid et deserunt dolorum veritatis velit quo quia alias fugiat soluta facilis qui deleniti accusantium officiis voluptatem voluptas debitis maxime aut laborum aspernatur eius ea voluptate reiciendis in occaecati et itaque aut voluptatem praesentium fugit facere odio assumenda unde rerum ut iste ratione rerum debitis labore tenetur consequuntur reiciendis temporibus ab quo explicabo est temporibus ullam ut sunt accusamus omnis sequi officia tempore praesentium quo animi aut odio qui quis aut commodi minus saepe maiores quibusdam at est numquam explicabo odit molestiae expedita rerum qui quae animi dicta eaque eveniet velit eos dolor deserunt id consequatur fuga voluptatibus impedit tenetur quibusdam dolorem provident odit ipsum consequuntur doloribus aut aliquid voluptatem distinctio quia rerum rem nostrum magnam omnis amet et eaque tenetur quidem occaecati beatae perspiciatis consequatur corporis dolores aut asperiores assumenda quia odit pariatur temporibus accusamus odio quis sunt et aut commodi culpa delectus beatae voluptatibus architecto et enim deleniti eligendi dolore ut aliquam deleniti vel velit voluptatem ipsa soluta in aut cum laudantium tempore enim deserunt et corporis omnis dignissimos assumenda beatae labore corrupti illum perspiciatis sit architecto et et nobis itaque non odit officia quis ut vitae eaque voluptatem maxime vel in odio voluptas quas doloribus possimus iure vel iusto repellendus veritatis velit quo voluptatem sed cum ab voluptatem eum itaque mollitia dolores voluptates dolorum dolores et ullam reprehenderit quo animi alias itaque nihil doloremque consequatur dolore ea iure voluptas nihil ut quis velit incidunt quo delectus quam libero at aut numquam beatae sit enim dolore deleniti minus sequi laudantium.', '1', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('384', '6', 'Fuga omnis repellendus totam repellendus aspernatur sed.', 'Est consequatur eum iusto eum quia explicabo saepe itaque aut omnis consequatur numquam eos officiis dolorum dolorum velit aut modi dolore ex labore dolorem vitae aut ut aut voluptatibus facilis autem perspiciatis quisquam nemo vero repellat velit minima aut quos ut vel velit maxime est consectetur et aut dolore in laboriosam ducimus voluptatem soluta qui tempore maxime et sint et rerum sint tempore nobis sunt nobis sed magni neque sequi magnam facere exercitationem sit non molestias neque esse repellendus qui tempore quisquam eveniet eligendi voluptatibus fugiat reiciendis qui eum dignissimos earum possimus qui magni vero enim voluptas dignissimos eos sit facere aut exercitationem quis quod tempore et harum et sapiente at accusamus nemo voluptas non natus aliquam porro ducimus quos voluptates et accusamus minus sunt dolores nesciunt rerum odit libero id suscipit a et molestiae et laudantium eligendi omnis voluptatem odit consequatur dolor voluptas recusandae sit distinctio eum inventore autem quo sit consectetur eius doloremque aperiam rem excepturi quia porro enim ducimus vero eveniet recusandae iste aliquam excepturi ea provident id distinctio tempora optio eos ut officia quibusdam eum odio eligendi porro eum sit et iusto ipsam quos explicabo eum aperiam quisquam autem sed dolores doloribus odit debitis rerum ut praesentium quas.', '0', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('385', '6', 'Aut magni numquam qui aut quis facere neque.', 'Molestias eos recusandae omnis maiores laboriosam assumenda similique ipsum non cum voluptas autem officia non adipisci numquam corrupti neque fuga et est aperiam non eveniet et voluptatum expedita consequatur nostrum recusandae corrupti impedit sed minima totam dolores illo deserunt nesciunt totam eum sint nihil vero ab eligendi est accusamus nam consequatur maiores libero recusandae facilis molestiae consequuntur est molestiae omnis ab consectetur natus fugiat molestias vero qui et fugiat molestias voluptatem occaecati eos hic qui quia nihil eum incidunt quisquam alias ut cum enim ad ipsum autem consequatur veritatis labore reprehenderit omnis molestiae molestias magni illo est natus voluptatem veniam sed quam aut quis cum sed debitis iusto voluptas eligendi explicabo dolorem qui nesciunt consequuntur perspiciatis magni numquam voluptas qui voluptatem corporis minus iure et sapiente minima dolore explicabo est omnis voluptas non sint nihil quis delectus placeat qui quia labore delectus voluptas sint sunt molestiae consectetur provident cum et voluptatum in itaque ipsa id quae voluptas et voluptatem temporibus et doloribus necessitatibus quod vel eum officia et excepturi cupiditate aut adipisci molestias et doloremque libero voluptatem voluptatem ut voluptas aut minus fuga nihil voluptas hic ut voluptas hic aliquid sit beatae possimus et odit exercitationem corrupti laudantium similique et totam libero laborum quis voluptas dolorem voluptatum sunt nisi saepe temporibus accusantium adipisci vitae voluptas asperiores sequi sint sit repellat dolorem inventore maiores dolores veritatis est ut et quaerat quam quaerat consectetur qui error vel sed at illo et nostrum ratione provident quia consequatur tempora facere impedit impedit dolor aut impedit distinctio id sit iste asperiores voluptas quasi sunt quos quis aliquid labore in optio ducimus dolorem alias voluptatem omnis ea n