INSERT INTO `course_news` VALUES ('386', '3', 'Minima ea fuga aliquid id debitis minus rerum.', 'Officiis id reprehenderit et quaerat ratione quasi consequatur dolor ut quam est laboriosam minus nesciunt amet minima facere est fuga aperiam repellat perspiciatis quia laboriosam hic non voluptatum sit dolore laboriosam quis et vel aut autem quis velit dolores reprehenderit facilis velit modi libero doloribus iure consectetur quo rerum explicabo odit minima quibusdam maxime sed hic itaque aut voluptatem laboriosam laboriosam autem cupiditate rem voluptatibus officiis sunt tempora nobis velit nihil incidunt dolorem aliquam nemo illum provident sit consequatur ratione voluptate quibusdam dolor excepturi quam vero ab aut eveniet consectetur itaque eos ut aut qui voluptas voluptatem consectetur aut et deleniti vel velit totam corporis ratione ut reiciendis autem est nam laudantium quia qui temporibus eveniet tenetur soluta totam odio voluptas dolorem occaecati quos maxime accusantium possimus velit eos minima aperiam earum explicabo voluptatem dignissimos qui et ipsam sunt sunt quia a et architecto numquam perspiciatis natus facilis adipisci maiores a dolores quasi labore corporis rem animi corporis et vitae eos rerum veniam atque quis voluptatem vero sunt fuga sit rerum est distinctio aut qui magni excepturi animi illo sint incidunt et perferendis expedita accusamus iusto hic in a rerum reprehenderit sunt eaque quaerat repellendus voluptas vitae natus est in esse eaque ipsam veniam totam ut et explicabo et dignissimos debitis veniam nihil beatae optio corporis nesciunt quas culpa et impedit dolorem ea est aut animi recusandae dolor nemo nulla dolor aut maxime eligendi quas repellat error perspiciatis blanditiis repudiandae sed.', '1', '2017-05-02 22:59:06', '2017-05-02 22:59:06');
INSERT INTO `course_news` VALUES ('387', '7', 'Ut totam ipsum est.', 'Ut odit fuga in occaecati totam nemo quia nam quod officia ut voluptas dicta veritatis vero necessitatibus eaque dolores veritatis ullam eos sint dolor ea hic beatae consectetur est voluptates sint sequi in voluptatem et nulla ullam dolorem velit quis qui perspiciatis aliquid qui quasi velit aperiam deleniti doloribus quisquam voluptatem deserunt maxime quia inventore neque corporis optio excepturi facilis non doloribus voluptatibus veniam sed vero sint eum maiores sed et totam aut soluta omnis et in esse repudiandae voluptas corporis iste quia esse praesentium quisquam unde hic ut laboriosam neque quia sequi corporis animi natus aliquid sunt ratione error perferendis voluptatem ea soluta cumque explicabo eos aliquid aperiam qui distinctio recusandae aliquid quos quisquam quo ex reiciendis nesciunt distinctio repellat deleniti consequuntur repudiandae eaque eius culpa nostrum rerum ex perspiciatis non consectetur aut sed animi rerum et esse impedit dolorum nam fugiat sequi unde ipsam nisi ut inventore repellat odit accusamus pariatur deleniti et est ipsam rerum et accusamus cum exercitationem similique ducimus repellendus pariatur doloribus doloribus reprehenderit et aut ipsum atque nihil aperiam odio consequatur eaque voluptatum et voluptates asperiores ullam alias ut et omnis voluptatem qui qui officiis facere et sit voluptatem numquam quo accusantium modi et praesentium qui quo esse et saepe est et temporibus et facere est accusamus illo sed voluptatum aut quia facere dignissimos quas quo aperiam nemo impedit sunt ipsam quaerat earum sed sunt quo incidunt eum enim veritatis voluptas saepe quo quod impedit est eligendi quae et consequatur architecto ullam fuga iusto ullam est placeat laudantium vel provident et ut est excepturi quaerat eligendi.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('388', '9', 'Voluptate qui harum est eaque dicta recusandae reprehenderit.', 'Necessitatibus quam soluta ut similique quia temporibus iste voluptas quidem consectetur reprehenderit minus eveniet sed amet recusandae qui aut eaque veritatis et dolore necessitatibus inventore laboriosam distinctio quasi modi earum eum rerum sapiente adipisci ad vitae id quidem nam beatae fuga aut omnis blanditiis vitae quibusdam omnis vel quaerat dolorem minima sed est provident libero numquam voluptatum repudiandae molestiae eveniet voluptatem aspernatur ullam quos explicabo porro porro laudantium impedit tenetur numquam neque est ullam aliquam atque sunt ut maiores in officiis qui non aut deleniti doloremque impedit qui asperiores repudiandae dolor fugit fugiat sit repellat sunt sint voluptatum reiciendis corrupti facilis eos optio provident iusto repellat eaque adipisci dolorum id id labore laborum rerum nesciunt repellendus repellat blanditiis facere quod earum vel officia molestiae labore dolorem perferendis reprehenderit neque perferendis in magni ea quaerat quibusdam voluptatibus aliquam dolor eaque eligendi impedit sint mollitia asperiores ut ab placeat et sunt tempore laboriosam qui soluta pariatur expedita distinctio doloremque quia voluptatem nemo quia ipsam nobis laborum accusantium temporibus sed aliquid et iure quam nihil consequatur deserunt ut non ut ut voluptatum neque numquam quia necessitatibus perferendis aut laboriosam quae eveniet qui natus quos dolores quia iste eius unde assumenda nesciunt expedita cupiditate error eligendi consequuntur dolorem labore unde quia nulla a sed molestias ea iure sit exercitationem est tempora ut sit totam facilis dolorem molestiae iure enim adipisci quo labore omnis commodi vel sed amet accusantium optio veritatis qui quod iusto eos sunt et praesentium atque sit repellat quis.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('389', '2', 'Unde explicabo quia architecto ut aut cupiditate.', 'Omnis ducimus optio omnis aut non enim rem expedita nesciunt autem rerum repudiandae nihil corrupti numquam laborum odit voluptas sunt aperiam omnis quam quia rerum unde est id ipsam corrupti est unde unde qui aliquid voluptas deserunt explicabo sit occaecati molestiae reprehenderit architecto vitae sed magnam rerum ex odio dolor velit fugiat quia ut eaque unde et facere dolorem cumque provident et ipsa rerum earum est autem quibusdam sint provident quisquam repellendus nostrum voluptas neque qui ea suscipit sed corrupti modi eum quo fuga ut sunt accusantium in exercitationem et fugit corporis tempore illo qui dolores veniam quis ducimus aut et placeat id est perferendis molestiae eaque et architecto non nesciunt illum est aperiam ut cum tenetur modi reprehenderit culpa et qui et odio consequatur architecto ea minus sint eos velit odio porro quisquam et nihil reprehenderit quod aperiam quia ipsam omnis quia quia est iste quia nam in explicabo ut autem tempora deleniti ut nihil quia et dolore distinctio accusantium est saepe laborum aspernatur ad quae architecto unde est animi impedit consequatur inventore soluta amet qui ut ut mollitia quia nulla aut earum ut voluptatibus consequuntur saepe amet assumenda cum amet quo quibusdam id mollitia et rerum libero accusamus repellendus maiores blanditiis dolores laboriosam aut dolores architecto explicabo est possimus quia et nulla ipsam distinctio ut possimus rerum non mollitia nam voluptas sed nihil quaerat exercitationem autem dolorem accusamus perspiciatis quibusdam quos delectus omnis aut nostrum laborum temporibus ab minima quos placeat dignissimos et aliquid explicabo non enim porro explicabo nulla voluptas mollitia inventore sunt laborum sit quia aut et qui nesciunt officiis officia molestiae culpa ut quia voluptas sunt sed natus vel quia ut inventore commodi vel omnis voluptate doloribus culpa saepe voluptatibus sit m