INSERT INTO `course_news` VALUES ('390', '1', 'Et voluptatibus ut qui recusandae hic perspiciatis reiciendis.', 'Corrupti vitae ullam eveniet aut dolorem dolores placeat debitis recusandae quod est porro minima omnis aut repudiandae molestiae id inventore suscipit adipisci quae fugit esse in animi incidunt harum assumenda voluptas temporibus distinctio sed ut est dignissimos veniam non dicta deleniti qui perferendis velit nesciunt dignissimos et veritatis vero non aut sed occaecati maiores assumenda rem impedit et quidem itaque in nisi sequi eos ratione perspiciatis harum nobis quaerat recusandae explicabo quas ut et minus id nam soluta nam et dolore porro quam sed dolor est vero eum dolor quia aperiam quo tempora repellendus reprehenderit in totam tenetur occaecati accusantium vitae non quaerat repellendus consequuntur est qui omnis praesentium enim et quo aut et non laborum vel sunt rerum quia est quia esse ut expedita sint dolores dolor earum ad consectetur minima ullam provident odio fugiat consequuntur facilis nesciunt numquam sunt nihil commodi magni provident saepe est autem tenetur in ipsam voluptatem est itaque suscipit unde recusandae nulla quod nihil accusantium id quia perspiciatis unde illum atque voluptas incidunt voluptatem consectetur et qui nulla aut autem nobis molestiae nesciunt laborum repellat non suscipit dolor voluptatibus minus illum inventore et et repellat deserunt itaque unde et qui quo tempora velit reprehenderit beatae laborum necessitatibus id repellendus commodi consequuntur laboriosam qui facere cumque omnis cupiditate sint quod est neque vel mollitia incidunt provident qui ullam sunt dolorem et id similique eum veniam voluptatem sapiente quos qui blanditiis in veritatis est aperiam aut et dolores aut dolores assumenda odio et ea ipsa corrupti debitis illum repellendus in et nisi omnis vel vel natus impedit vitae quia voluptatem quis voluptas est quia sint autem rerum ut ab quis laudantium maxime consectetur assumenda quas distinctio blanditiis maiores est quasi hic maiores cupiditate id molestiae libero assumenda maiores tempore nisi libero dolor aut eum qui sed animi labore incidunt vero sint velit veniam nulla reiciendis aut quo ad eligendi asperiores et officia dolor voluptate aspernatur architecto in nam eum deserunt totam qui rerum unde dolore excepturi voluptas enim qui eligendi quod atque dolores praesentium dolor ea neque sunt tenetur et eius quia ullam in qui architecto aut soluta fuga sed voluptatem error eum fugit eveniet occaecati similique nisi aut rerum pariatur reprehenderit recusandae et molestias eaque doloribus architecto repudiandae asperiores suscipit dignissimos fugiat est perferendis voluptatum minus ipsa sed quis quas.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('391', '3', 'Possimus consequatur asperiores rem accusantium rerum.', 'Rerum commodi deleniti sit delectus et eius consectetur aliquam quo optio eligendi asperiores omnis quos qui odio non voluptates perferendis rerum voluptatum quidem consequatur consequatur est est fuga assumenda quisquam quam nihil ea est dolor autem sit id facilis possimus aut possimus ea maiores nemo autem delectus non non reiciendis et est itaque molestiae laboriosam dolorem neque nemo aperiam quos earum non id fugiat eum qui maxime pariatur non dicta aut distinctio optio quos perspiciatis cupiditate omnis aut autem quam repellendus sit suscipit quod dolores eaque voluptatem esse atque voluptatem et eum eos voluptatibus non saepe facilis velit tenetur est qui quia voluptate odio architecto amet placeat unde facere qui consequatur sit excepturi occaecati laboriosam ut quidem qui sit hic nam facere et ducimus et magni magnam numquam distinctio velit occaecati molestiae commodi velit veniam sit repellat eum sunt sit laudantium sit voluptatem qui ipsum quidem vel aliquam similique iste aut reiciendis quod pariatur qui necessitatibus ut dolorem totam doloremque dolores perferendis voluptatem facere adipisci veritatis quia vel earum laboriosam libero velit facere dolores natus incidunt fugiat exercitationem dolor veniam consectetur soluta est rerum reprehenderit quia suscipit impedit enim quia corporis quaerat omnis ut dolorem ut iusto sed veritatis quae voluptas eligendi et quis natus accusantium quibusdam rerum autem labore id autem perspiciatis autem eveniet et dignissimos in aut provident iusto veniam praesentium tempora ipsa autem iure dolorum voluptatem perspiciatis est sit omnis minima neque accusamus sequi incidunt modi reiciendis nihil totam explicabo ut.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('392', '9', 'Accusantium accusamus quia magnam est voluptatem dolor.', 'Earum quia alias porro beatae praesentium eum dicta maxime aliquid autem natus nihil dolorem et rerum natus maxime quia iure sequi cupiditate et porro omnis sunt suscipit facere harum minus nulla dolores dolor ad ut explicabo dignissimos quasi tempore sunt voluptatum dicta et laboriosam harum iste nulla molestiae magni repellendus ut voluptatem ut autem nulla rerum architecto dicta aut animi blanditiis culpa earum voluptas unde neque impedit et incidunt amet architecto dolorem sunt in blanditiis et modi iure est a est corrupti aut et ut quo repellat sed necessitatibus voluptatem voluptas occaecati facilis sit magni quia et mollitia repudiandae tempora enim temporibus quis itaque occaecati esse quibusdam quia est enim quos animi ducimus labore est dolor deserunt id ipsam consequatur odio quo assumenda placeat et recusandae nulla vel et quia est eum eum debitis ipsa praesentium illo soluta incidunt voluptatem ipsum corporis nihil nesciunt ea impedit cupiditate incidunt asperiores et quam aperiam voluptatem rerum voluptates quia officia quia error voluptate tempore quia aliquid porro nam est voluptate sequi cum veniam est in voluptates aut blanditiis necessitatibus earum rem ullam accusamus nesciunt aut quis nesciunt sit minima tenetur nisi qui ea cum commodi qui cum asperiores et qui et saepe ipsam ex esse velit voluptates accusamus velit accusamus aliquam dolorem sed vel quas nostrum eum ad voluptatem sequi eius molestiae occaecati consequatur totam aliquid in est labore eum numquam corporis rerum excepturi nemo non perferendis id ab exercitationem odio odio deserunt velit quis animi voluptas libero alias libero corporis consequatur et labore iste vero perspiciatis sed tenetur nulla omnis adipisci aspernatur dolores natus.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('393', '5', 'Ipsum nulla perferendis nihil qui.', 'Dolores cum minima dolor enim voluptas sapiente deserunt voluptatibus ut deleniti ipsa sed amet explicabo voluptas sint autem provident quos ut consectetur dolorem cupiditate repellendus omnis fugiat doloremque officiis quis aut et quaerat veritatis sunt deserunt non harum voluptatem architecto aut qui et sunt quae ut quis enim dolor aspernatur et ut nemo vero praesentium illo et occaecati veritatis iusto ipsum ut facilis quis et nihil atque quo eligendi aut deserunt placeat consequatur voluptatem ullam nihil sed dolorem dolorum est ex ut eos qui numquam non eligendi qui ad voluptates repellat nam expedita quam hic et aut ipsa necessitatibus voluptatem velit non cupiditate tempora occaecati rerum ut et expedita laboriosam recusandae excepturi magnam doloremque ipsa iure perspiciatis vitae eaque et assumenda ut sit tenetur voluptatem sit perferendis et quos eligendi et tenetur rerum quam vero delectus consectetur beatae aut et autem voluptatem eaque repellat dolor commodi sunt ullam sunt magnam consequatur voluptas ut suscipit et eaque beatae vel sequi suscipit quaerat adipisci est officiis dolor repellendus dolor et non perferendis ea quis qui deserunt aliquam quos ut delectus omnis porro facere architecto eligendi at sapiente quia sunt eaque vel sit consequuntur aliquid adipisci cum quia voluptates aut eligendi cupiditate unde eos ut qui fugit nihil blanditiis eum sapiente dignissimos nostrum aut maiores assumenda et est nihil et earum sunt nihil a nulla labore eos est at recusandae amet dolores commodi sunt ipsum autem ex aut voluptatem sit itaque.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('394', '1', 'Odit nostrum est et ipsam.', 'Nihil saepe neque mollitia eveniet expedita odio sapiente iure voluptas ratione error ipsa dolorem eveniet ab cumque aut qui qui ad quibusdam maiores modi ab blanditiis aut doloribus cumque amet laborum placeat consectetur itaque quibusdam vitae mollitia non sapiente quisquam pariatur eum quam facere sint velit odio ipsam non fugiat sit ut asperiores est eos illum incidunt consectetur enim qui labore omnis sint tempora eos assumenda qui non quisquam quas doloremque explicabo dolorum et qui quis delectus mollitia exercitationem aut veritatis tempora distinctio rerum ut dicta inventore asperiores possimus autem rem voluptatem quae sunt consequuntur magnam sed et earum voluptate quia molestias optio blanditiis eaque esse et hic quisquam animi nulla voluptatem quisquam corporis quo suscipit saepe iusto enim consectetur qui et perspiciatis atque saepe id qui dolor rerum qui beatae voluptatibus illum natus non vitae quibusdam quo deleniti sit earum consequuntur non totam nesciunt rerum non quia et iusto et et rerum consequatur odit quibusdam fugit consequatur itaque molestias quia corrupti dolorem provident labore quo qui beatae sed voluptates quia consequatur quaerat nam consectetur esse et ea qui amet et quae similique perferendis quia ducimus et et magnam enim magni labore eveniet et temporibus deserunt aut laboriosam praesentium at voluptate quos officia rem repellendus et eligendi dolor sequi rerum assumenda tenetur provident voluptate.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('395', '2', 'Ullam veniam itaque quam.', 'Perferendis et et quaerat et consequatur vel qui et molestiae ut beatae deserunt qui est sed sit labore quam nisi assumenda eum ullam culpa accusamus quisquam voluptatibus autem voluptatem eligendi minima odit accusantium ipsam aut aut ipsa totam vel dolor quas dicta dolores laudantium consequatur mollitia reprehenderit ut id qui enim rerum ut vel et enim molestias non quaerat a velit asperiores sed qui qui minus incidunt laborum vero similique minus beatae ut quaerat ad non illo sit sed culpa soluta modi sed non perferendis natus eos molestiae eos aut ex quia qui ex sed suscipit ut ut voluptas possimus ut sint blanditiis quo distinctio eius aliquam ut est assumenda dolorem magnam impedit et impedit labore sed voluptatem sit adipisci iusto blanditiis quasi recusandae dicta et aut quia necessitatibus non dolor sequi error similique possimus perspiciatis consequuntur nostrum itaque iste architecto error quod sit qui tempora ab minima ducimus qui amet dolor maxime aut a tempore sit laudantium recusandae sapiente adipisci nihil architecto eius vel consectetur optio error aliquam nihil tempora asperiores magni et tempora et recusandae enim reiciendis aut voluptates ea adipisci rerum.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('396', '10', 'Fugit quasi molestiae illum.', 'Magnam incidunt aut aut quia minima maxime nihil cumque et cum nemo est necessitatibus maxime ullam eum iusto eum incidunt harum reiciendis ut vel hic eum nulla quae doloremque impedit enim pariatur ad consequatur ipsam maxime illo qui dolor voluptatibus fugit suscipit dolorum ut consectetur quas qui ut quas minima doloremque non eos quisquam dolor perferendis dolorem nulla sit dolores odio est repudiandae beatae ducimus cumque nulla quae inventore dolore tempore molestiae voluptas officia odio itaque non sint sequi asperiores animi magnam et cupiditate quis aut optio ut quod et ut in velit fuga praesentium atque voluptates quaerat labore placeat velit in magnam eaque officiis nostrum rem voluptatem facere illum quo sunt officia excepturi sed ducimus qui voluptate ea nihil praesentium laborum magnam enim sed voluptatibus ullam vel molestiae omnis voluptatem qui maiores ut quia nihil reiciendis ducimus hic nihil similique non expedita voluptatum corrupti earum nam debitis illo velit ad voluptates iure illum veritatis ipsum maxime aliquid omnis temporibus et est dolores dolore est atque ea eaque excepturi non ad repudiandae cum minima exercitationem nemo laborum voluptatem sed aut illum nostrum repudiandae omnis harum consequuntur fuga quos laboriosam dolor iste odit provident quam sapiente dolorem dolor qui deserunt vero et omnis eos hic cupiditate voluptate omnis dolores in enim consequuntur accusamus iste iure accusamus laudantium velit non labore ipsa voluptatem ipsam quia vel veritatis ullam ut harum velit ut animi voluptatem aut enim sunt id debitis et excepturi laborum excepturi ducimus a ipsa dolore harum et incidunt voluptatem ut eos at eligendi aut eum itaque facilis aliquam quibusdam maiores est qui in ducimus tenetur harum dolore est dolor omnis autem sunt molestiae reprehenderit placeat sed amet sit praesentium accusantium animi alias consequuntur rerum distinctio nam recusandae laboriosam deserunt eaque ut sed occaecati eius quam voluptatem aspernatur ipsam natus maxime ut porro dignissimos non dolorem est dolor laboriosam exercitationem porro sapiente dolorum nihil est voluptatum nulla veritatis assumenda sit occaecati quam necessitatibus dignissimos explicabo accusantium et voluptas nesciunt rerum fugit repellendus suscipit similique qui eaque cum sint quasi quae quis eaque alias aut aspernatur similique sunt et non occaecati quasi quidem mollitia est vel voluptatem eligendi qui asperiores voluptas perspiciatis quis animi quia corporis ipsam labore quam quia ullam et dicta et quidem inventore qui optio quia qui vel ratione fugit necessitatibus itaque explicabo est ipsam perspiciatis laboriosam voluptate autem error ullam voluptas voluptatem dolor ut maxime.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('397', '2', 'Molestiae inventore aut nesciunt voluptas et assumenda quis.', 'Est et sint et dolorum qui quo itaque doloribus sed id vel magni saepe a totam recusandae est similique et quisquam qui delectus dolores officiis voluptates aliquam id magni velit temporibus quod cupiditate rerum totam aliquid magni ratione sunt blanditiis in sit et ut nobis at laboriosam aspernatur mollitia eum asperiores dignissimos eos quod sunt eos consequatur provident est iure et cupiditate sint quae neque voluptatibus similique aut eos et eveniet labore ea impedit consequatur cupiditate perferendis adipisci vitae illo provident ipsum id nobis voluptas voluptates rerum cumque dolor officia odit impedit earum ullam sint non provident atque voluptatem enim qui aut incidunt laboriosam nihil odio perspiciatis laborum qui ipsam laudantium id ipsam consequuntur temporibus itaque est ut rem ipsum modi consequatur officia molestiae optio non itaque ut dicta ratione quia voluptatem atque reiciendis adipisci voluptatem quas id omnis ullam provident rerum id laboriosam illo deserunt et totam excepturi quia vitae nihil ipsum ipsum atque non dicta rem soluta esse odit dolorum magnam exercitationem exercitationem sequi vel esse dicta quam libero voluptas aspernatur sed fugiat laborum perferendis minus quisquam similique dignissimos ut saepe delectus illo voluptas illo delectus impedit dolores rem hic dolor dolorem dolorem sunt molestiae eveniet aut aliquam numquam quia ab delectus eos nam sit animi sequi vel omnis incidunt eveniet quam magnam unde eaque sit temporibus dignissimos est dolores saepe voluptas facere fuga id distinctio non fuga laudantium qui quidem sed nisi voluptates dicta et neque aperiam aliquam autem aliquid tempora similique aut assumenda ut molestiae optio voluptas velit pariatur dolorem et exercitationem recusandae sed ea aliquid minima nihil amet fugiat et enim esse quam qui sint voluptatem et illum voluptas adipisci voluptas inventore minima voluptatem nihil ut at quia reiciendis deserunt incidunt commodi est unde reiciendis omnis alias in fugit doloremque ipsum cupiditate quia voluptatem asperiores eius suscipit illo ex voluptas odit dolores consectetur aspernatur ut aut dolorem explicabo debitis consequatur asperiores id et dignissimos dolore necessitatibus culpa ab aut qui iste porro ratione nesciunt est alias quo dolorem id.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('398', '4', 'Officiis illum molestiae voluptates doloribus.', 'Ea quo fugit ea odio amet perspiciatis sed repudiandae eos autem ex nemo tenetur facere atque eligendi quo aliquid quidem fugit sequi consectetur ut quia laboriosam magnam qui accusantium est cum nam ex quo dolorem reprehenderit possimus eius aut nulla velit asperiores numquam ullam cum laboriosam vel voluptatem qui nulla iure labore quia ab est unde odit rerum adipisci beatae autem numquam saepe natus consequatur maxime debitis ab et dignissimos placeat dignissimos fugiat porro nulla non debitis nobis repellendus illo nesciunt soluta deleniti unde qui possimus ut earum laudantium dolorem officiis tenetur sit qui voluptatem sit rerum rerum qui accusamus odio occaecati architecto molestias quidem debitis quod consequatur sunt qui inventore et non tempore quaerat commodi eos aut et alias debitis est sint a tenetur enim non id rerum debitis omnis rerum eveniet eligendi possimus alias et et numquam dicta corrupti distinctio voluptas voluptas minus vero harum et quidem dolorem aliquam magni accusantium molestias voluptatem iste quam ipsam asperiores reiciendis voluptatibus eum molestiae neque eius rerum rerum fugiat animi ut minima ducimus itaque in et animi voluptatem aut eaque praesentium perferendis ullam qui eum iusto rerum ab aut est quisquam voluptatem deleniti sunt culpa eum distinctio tempora assumenda molestias ut omnis corrupti accusamus voluptatem corrupti quam laudantium autem vel quibusdam possimus quis dolorem odio nostrum quaerat dolore aut corporis incidunt eveniet ducimus nihil.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('399', '10', 'Sit nobis non sint ad eum natus.', 'Nostrum fuga voluptas et voluptatum explicabo delectus sequi voluptatem perferendis nostrum nisi in voluptates corporis animi aperiam porro provident autem repellat mollitia aut suscipit vel quibusdam ut occaecati velit quam magnam nulla facilis laborum quia alias animi dicta quaerat autem quasi non eum expedita nisi aut aut labore quis porro ex provident et illum est qui aut est qui qui quia voluptatem et dicta neque asperiores illum perspiciatis quia ea rem nesciunt deleniti ipsum sed placeat veritatis iusto impedit modi et repellendus a qui nam voluptas repellendus aut tempora voluptatem vero dolorum id ut est minus cumque debitis itaque non molestiae delectus et voluptatem magnam totam impedit sapiente est rerum ad animi fugit voluptatem voluptatum molestiae doloribus et et iusto beatae incidunt qui quidem quia dolorem id veritatis odio alias praesentium qui praesentium non neque facere magnam veniam temporibus consequuntur reprehenderit veritatis quos exercitationem impedit ipsam officia odit in suscipit sint facilis minima qui et doloribus qui minima et tempore alias reiciendis animi non saepe maxime natus similique delectus id quod optio facilis voluptatum at a fuga consequatur consectetur distinctio ad quisquam consequuntur error sunt facilis dolor minus est sint nihil dicta ipsam magni molestiae nam asperiores dolore repellendus asperiores error ipsam sit aliquid consequatur dolor qui repellendus quis ut ea quasi eos aut id voluptatibus et minima magni et ut est quod earum ipsam et qui ex odio illo sed saepe nihil laudantium et minus et cupiditate voluptate aut non in maiores porro mollitia nihil qui saepe perspiciatis et rem maiores tempora ut et voluptas rerum asperiores aut officia non molestias dolores corporis aut est cum nihil nisi et ut harum beatae sequi quos est vitae magni enim sequi praesentium et amet nesciunt dolorem accusamus magni autem excepturi dolorum natus