INSERT INTO `course_news` VALUES ('400', '9', 'Doloribus ut amet iusto facilis est et.', 'Voluptatum dolorum non aliquam est aut ipsa vero suscipit libero fugiat rem necessitatibus quis similique qui quasi libero sit officia veritatis voluptate est est impedit blanditiis omnis molestiae fugiat officia aspernatur rerum doloremque ad maxime reiciendis id soluta laboriosam tenetur tempore libero excepturi nihil autem ipsam cupiditate facilis non nobis qui nihil fugiat saepe culpa exercitationem quo fugiat suscipit sed facilis ea et et repudiandae et non incidunt accusamus necessitatibus placeat est nesciunt minus neque aut consequatur ad nobis sint hic qui aut veniam ipsum inventore cupiditate aliquam velit at excepturi commodi ea incidunt mollitia voluptas laudantium laborum velit commodi ut sequi assumenda consequatur fugit veritatis alias quidem assumenda eaque id tempore et sit soluta sint porro praesentium ea animi nostrum nesciunt ut perspiciatis enim doloribus et dignissimos culpa dicta molestiae officia fugit quibusdam quia maxime quia harum iusto quia qui repudiandae sapiente iusto odio fugiat unde aut odio et repudiandae nihil corrupti minus eveniet dolor eveniet eos soluta non voluptas eligendi nisi velit quia sequi ad voluptatem possimus dolorum quasi id quam sint reiciendis voluptatem ex adipisci corrupti temporibus voluptatem officiis dicta eos eveniet quaerat libero sit deleniti eum est officiis in quod similique non vitae delectus deleniti magnam qui autem architecto facilis laborum autem laboriosam nisi similique ab beatae vel repudiandae mollitia qui illum sunt est eaque excepturi maxime autem laudantium cupiditate totam saepe aliquid maxime rem dicta quos impedit ipsam adipisci aut eligendi velit est adipisci quia ut quidem odio sed error voluptatem earum vitae a animi qui cum doloribus aut voluptatem quos laudantium ut est consequatur ea eaque earum a sunt totam dolore architecto quas quia sed magnam explicabo ipsum omnis voluptatem ad dolorum veniam et ut rerum nihil vero consequatur animi ea iste qui occaecati nesciunt consequatur quaerat quibusdam sapiente iste voluptas quia accusantium exercitationem vero deserunt totam placeat et nesciunt et aperiam occaecati et id ducimus necessitatibus provident et earum accusamus qui consequuntur dolorem doloribus ipsa et tenetur aperiam corrupti reprehenderit a libero officiis inventore quas ab fugit aut dolorem repellat perspiciatis et aliquam rerum voluptatem quas molestiae commodi quia eos aut qui et mollitia voluptas delectus et quidem excepturi natus et fugiat dicta nihil minima earum recusandae voluptates et similique cumque dolor cum natus deserunt eos dolores deleniti dignissimos nihil magni ratione laboriosam porro numquam non quaerat et reprehenderit odit ratione et nihil autem rerum numquam labore assumenda odio maxime numquam vitae voluptatem debitis labore sunt sed rerum nihil et rerum est dolor vel culpa est ea voluptate sit quos adipisci qui qui ex.', '1', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('401', '10', 'Quis veritatis eum accusantium.', 'Qui accusantium aut quo corrupti quasi a repellat deleniti et vitae distinctio doloribus delectus veniam voluptatem dolorem dolor autem eos quia dolor dicta sunt eligendi ut dolores assumenda eum omnis similique voluptatem sit ut veritatis eligendi voluptatem culpa sequi eos quas et nihil illo occaecati repellat incidunt voluptatibus aut asperiores recusandae et asperiores debitis voluptas commodi consequuntur laudantium quam ipsa quia est quo quo dolores maiores ipsum dolor animi sed quia ullam optio qui impedit velit excepturi neque ab fuga unde earum expedita non deserunt est necessitatibus dicta amet rerum vitae dolor excepturi et cupiditate debitis est voluptatibus voluptates itaque aut quasi sint voluptas qui laborum nam fuga dicta praesentium animi magnam in suscipit cupiditate qui non repellendus eveniet cupiditate placeat nisi suscipit voluptas eius maiores dignissimos eligendi tempore reiciendis voluptas quae est cum quia sed in dolores temporibus et corrupti et dicta dignissimos eum qui provident ipsa expedita et corporis iste placeat reiciendis error eos eos culpa aut voluptas voluptate voluptatem et deserunt aspernatur harum animi facere sed ipsam quia dolores voluptates incidunt libero delectus vero a consectetur id qui quam accusantium eveniet quae ut atque perferendis aut id iusto omnis nemo assumenda in commodi dignissimos blanditiis omnis dolor reprehenderit odio sunt aliquam quia adipisci dolor non rerum necessitatibus dolore assumenda aut animi magni excepturi nisi est perferendis voluptatem natus et voluptatem quae quos repellendus officiis ut doloremque recusandae sequi minus optio praesentium aut ex ab ratione illo recusandae labore quia tempore aut sed cumque animi omnis sapiente nesciunt et atque cumque deleniti dolor et velit ea alias autem ut dolorem et sed et ab sed cumque.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('402', '10', 'Nulla architecto quidem ut natus voluptatem tenetur dolor.', 'Asperiores nostrum ex ut accusamus sint harum sed nobis qui quos dolores id reprehenderit eos magnam cum enim ipsum quia ducimus tempora nemo voluptas delectus quas in tenetur aut sed sint tempora id itaque cupiditate vitae reiciendis placeat voluptatem occaecati magni vel doloremque voluptatem non aut qui ullam id accusamus odit facere illum facilis reiciendis minus sed qui fugiat dolorem a numquam eum et omnis cum veniam officia fugit odio qui dolore odit culpa impedit laboriosam praesentium dolor odio molestias et id dolor architecto est officiis fugit in earum error doloremque laboriosam dolores numquam enim qui ratione cumque accusantium dolorem sit voluptatem veniam sed rerum autem nobis laudantium rerum qui ipsam aut cumque asperiores quia est nihil recusandae esse voluptatem voluptas perspiciatis quibusdam eum itaque deleniti earum et est dolore natus fugiat aut magni quisquam nam est quo amet et placeat expedita quos rem provident tempora et quis recusandae corporis porro aut amet et et qui et cumque assumenda possimus magni est maiores voluptatem quia corrupti assumenda quos quaerat quis accusantium est aliquam et et sint sunt ut fuga ex laborum repellendus molestias dolorem quibusdam et ab earum similique ea et ut expedita accusantium distinctio est non quaerat laboriosam.', '0', '2017-05-02 22:59:07', '2017-05-02 22:59:07');
INSERT INTO `course_news` VALUES ('403', '1', 'Id quam repellat qui natus.', 'Maxime mollitia dolor quisquam est autem et voluptas perferendis architecto voluptate nesciunt itaque cum dolores odit eveniet esse praesentium quia voluptatem et facere velit suscipit similique ad vel recusandae beatae illo sequi nisi qui temporibus voluptate earum cumque quisquam maxime ex ratione asperiores aut voluptatibus alias qui rem animi accusantium fuga placeat nihil fuga aut explicabo veritatis est aut cum non corrupti et magni enim nisi excepturi a praesentium quia fugit est voluptas dolore aut reprehenderit est porro facere expedita officiis est quia qui quia sed dolorem et nulla id ut deserunt voluptates ullam et exercitationem debitis placeat illum aperiam aut in eaque et animi sed enim et atque nobis sunt dolor quidem eveniet dignissimos ut doloribus amet voluptatem quos corporis debitis quo eius est fugit temporibus et non aut distinctio illum molestiae ut similique enim consectetur recusandae incidunt quidem et impedit eum sed porro ducimus nesciunt magnam dignissimos nihil qui nulla voluptas asperiores magni excepturi facere voluptatem porro non dolore quidem qui nulla sunt harum veniam modi quasi aut dolores possimus eaque quibusdam exercitationem possimus optio laudantium dicta facere iste debitis asperiores ut qui rerum dolores esse dolor quos eius omnis cum qui ut perspiciatis dolores voluptatem pariatur tempora placeat voluptatem qui iusto et est similique quisquam possimus tenetur beatae dicta sit soluta molestiae animi perferendis est similique similique laudantium ex voluptatem unde id repellat autem ratione velit ab eligendi qui perferendis est molestias mollitia blanditiis est qui odit fugiat soluta corporis illum assumenda autem molestias non incidunt accusamus eligendi quaerat aperiam voluptatem iste qui maxime iusto animi est fugiat et quia adipisci nihil animi fuga sint ipsum hic enim natus eveniet distinctio et ea consectetur explicabo aliquid eveniet vero