INSERT INTO `course_news` VALUES ('404', '7', 'Sit eum eveniet molestias eius odio aut dolorem expedita.', 'Provident magnam officiis in repellat qui sint soluta non numquam qui recusandae explicabo vel commodi qui non quae odio voluptatibus iure sit recusandae dolor minima animi dicta et velit voluptatem asperiores excepturi labore quo quaerat corrupti ut ab ut voluptatem rem asperiores necessitatibus porro amet qui ullam soluta reprehenderit laudantium deserunt amet et velit dolor corporis non incidunt accusamus voluptatem veritatis itaque debitis dolores explicabo praesentium labore eius corrupti ab pariatur in repellendus asperiores est eos provident et dolores rerum unde nemo ea aut optio provident qui corporis labore velit atque dolor et animi et temporibus aperiam eaque et ipsam aperiam ex soluta non aut delectus tenetur ipsam error rem odit beatae ducimus consequatur suscipit minus ipsum quidem et laudantium adipisci illo adipisci id laborum placeat fugit amet et maxime voluptatem mollitia dolore dolorem fugiat ea inventore voluptatem qui ea alias fugiat aliquid aut alias alias ratione sint animi omnis aut et ut aut occaecati provident soluta quae nostrum quis deserunt aliquid non non iste eum culpa at animi ducimus maiores consequatur ut magnam adipisci iste voluptatum velit omnis culpa modi autem molestias non tempora aut asperiores sapiente dolorem inventore accusantium veniam sunt tempore dolores suscipit qui ut deleniti sit magnam reprehenderit porro iste dolores ad et rerum facere dicta accusantium qui eum consequuntur inventore dolorum assumenda non nostrum magni consequatur architecto facere est veritatis libero id et laboriosam autem quisquam ut repellendus corrupti repellat vel quia sunt dolorum omnis vel sed vitae eius harum excepturi maxime deleniti earum unde culpa minima voluptatum tenetur aut ex repellendus ut molestiae rerum voluptatibus nihil qui voluptatum earum consequatur debitis qui inventore fugiat nostrum enim iure aperiam.', '0', '201