INSERT INTO `course_news` VALUES ('405', '2', 'Mollitia illo explicabo laudantium eos.', 'Delectus consequatur est assumenda nostrum vel eos magnam voluptates illo sunt aut voluptas voluptas est suscipit qui quia quis voluptas qui tempore necessitatibus labore quo facilis dolorum ea rerum et id nemo quia enim aliquid rerum suscipit dolorum qui possimus voluptatibus iure et occaecati tenetur est maxime repudiandae cumque sed est neque qui soluta tempore aut adipisci aliquam impedit in molestiae nihil fugit dolorem sit aut id nostrum nihil molestias quis a ullam quod praesentium omnis voluptatem soluta sint illo dolorum dolor vitae fuga odit harum et est accusamus id odio veritatis provident doloribus officia voluptatum laudantium suscipit dolor quae blanditiis perferendis saepe recusandae sint qui est voluptas eveniet quisquam dolor omnis et perspiciatis nulla esse molestias excepturi numquam mollitia facilis rerum qui explicabo nulla et qui impedit qui fugit deleniti dicta veniam sit eaque aut eos unde ut esse ut ipsa quam laudantium ut explicabo perspiciatis tempore beatae ex et quam commodi ea eos aspernatur culpa aut iste cumque autem laborum id nihil quasi dolores ducimus ut id dolores fuga iusto quae esse praesentium est excepturi non numquam non atque occaecati reiciendis quaerat sunt deserunt provident amet voluptates corrupti in vero cum libero corporis iusto esse qui distinctio voluptates magni est cumque quia rem voluptatem voluptatibus doloremque porro ea corrupti deleniti odio officia voluptatem sit eveniet quasi accusantium voluptate maxime dolores fugit ut doloribus dolores sit corporis nostrum libero ut omnis qui mollitia perferendis esse sapiente nisi tempore facilis sit cumque ut et nostrum veniam ut eius rerum modi illum et aut animi ex rem esse eos cupiditate consequatur odio eveniet nihil labore consequatur similique quis porro fugiat aliquid consequuntur aut dolorum cum eum magnam dolore numquam perferendis ea voluptatibus vero rerum.', '1', '20