INSERT INTO `course_news` VALUES ('406', '9', 'Quidem dolor maxime aspernatur labore.', 'Nisi in consequatur aut in tempora consequatur et aut corrupti quasi enim labore assumenda itaque quo molestiae suscipit iste quaerat in doloremque quos qui deleniti corporis molestias ipsa dolorum officiis sit eaque explicabo voluptatem quod aliquid et dolor qui velit quas est ut ratione omnis quidem cupiditate fugit consequatur doloribus ullam quia adipisci qui et rerum ut vel qui aspernatur consequatur praesentium earum aut quia quo laboriosam illo magnam dolorem quia dolorem iste reiciendis voluptatem et nisi hic dolorem deleniti ipsum facilis ad nobis quia dolores ut amet est eligendi nam non quia qui voluptatem rerum consequatur deleniti voluptate nostrum dignissimos deleniti eos tenetur reprehenderit eveniet beatae id assumenda occaecati et occaecati voluptas veritatis consequatur cum eaque deserunt consequatur eum nam sint a modi accusamus ex et debitis dicta sed eum ut ex nihil molestiae sapiente molestiae quibusdam numquam placeat et ducimus ipsum quis itaque rem maxime et aut fugiat temporibus ducimus quam quo esse neque esse aperiam eos perspiciatis quisquam eaque tempore est officiis ipsum laudantium corporis quisquam enim labore non voluptatem vel dolores esse atque provident id esse est ipsum distinctio voluptas quisquam facilis et nisi enim sint in est asperiores quos veritatis quo natus est nobis sed commodi eum velit aliquid fuga dolore harum architecto explicabo dolores blanditiis et quidem error sit quia amet et nihil itaque quisquam cupiditate eveniet expedita nostrum atque aliquam aut iste maiores quos dolores nostrum ab est est natus sunt consequatur perferendis quos perferendis porro nesciunt omnis sunt ipsum in voluptatem adipisci quis ea error consequatur consequuntur est laudantium est error nisi quaerat a impedit et quibusdam inventore molestiae sed sed aspernatur voluptate quae quas cumque qui veniam quibusdam est veniam atque.', '1', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('407', '5', 'Iure et iure hic repudiandae dolorum laboriosam.', 'Architecto alias aut ex sint quas expedita et nisi recusandae et nisi dolorem at quod illum expedita dolorem necessitatibus officiis qui ipsum minima dolor qui explicabo nobis non quia quidem sunt omnis consequatur quas molestias sit et iusto ut laudantium quia ut vitae accusamus omnis debitis rerum magni quis sit architecto mollitia minus aut assumenda id mollitia magni sapiente sint earum voluptas et aut accusamus nulla vel doloribus doloribus perspiciatis unde eligendi quia nostrum eos sapiente facere ab vitae nisi occaecati distinctio minus nobis iusto eum quibusdam iste eos quibusdam fuga provident nisi ratione adipisci praesentium ut error quis repellat maiores perspiciatis facilis voluptate odit aut minus quidem et quos repudiandae ipsum perferendis id fuga dolor repudiandae qui molestiae esse qui suscipit consequatur quis nulla et adipisci est ut ab quo molestias et officia totam sunt explicabo perspiciatis amet alias iste aliquid autem exercitationem sed enim itaque quia a cupiditate est sit expedita maiores asperiores inventore explicabo aut eos eligendi consectetur nostrum qui accusamus earum magnam nihil iste veritatis vitae sed veniam laudantium laudantium rem praesentium illo et accusantium enim ab atque quibusdam vel assumenda maiores odit exercitationem dolorum aut veniam voluptatem amet qui sunt suscipit ex qui harum nesciunt autem dolore beatae eaque est rerum iusto et omnis deserunt laboriosam alias inventore qui repudiandae necessitatibus quia quas et suscipit non ut error libero corporis necessitatibus voluptatibus aut quaerat ad quis ut maiores officia delectus voluptas quaerat voluptas labore aut in aut dolorem quae cum et deleniti animi nemo ipsa qui asperiores unde rem laboriosam est numquam provident voluptates omnis dolorem et et ducimus asperiores quas dicta voluptas repudiandae exercitationem est quas quas quis maxime velit dolorum mollitia neque quis sunt eaque quia consequatur nihil ullam dolore aut architecto rerum aliquid et et necessitatibus cupiditate ea excepturi omnis qui et voluptates et iure doloremque voluptatum placeat quas voluptatem nihil atque repellendus quis officiis officia aut omnis libero quia occaecati repellat quis quis aliquid sunt eaque distinctio optio perferendis sed qui voluptatem voluptate enim ut iste a non dignissimos et deserunt eum doloremque exercitationem totam delectus in tenetur odit dolorem voluptas possimus officia totam ab fugiat facere rem veritatis sequi dolores ea non velit vitae est qui voluptas ut culpa necessitatibus ea debitis distinctio sint ducimus enim.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('408', '6', 'Assumenda et nisi iusto vel vel.', 'Voluptas blanditiis aut sed fugiat possimus temporibus est perferendis non molestiae et fugiat aut doloribus quos ullam autem amet perferendis in nesciunt quod rerum aut et fugit perferendis iste sint quas numquam officia architecto aut quibusdam sapiente quae non expedita ut vero ipsa blanditiis et rerum nemo debitis similique quasi hic harum molestias voluptate et nam sunt molestiae explicabo optio assumenda aut voluptatem voluptatem et ut modi repellat consectetur qui architecto sequi omnis ut exercitationem molestias excepturi odit molestias ea qui fugiat reiciendis reprehenderit quo omnis doloribus repellendus ut est modi soluta quis pariatur soluta quas possimus officia nulla est at et quia sapiente culpa dolorem ut sint voluptas dolores enim qui animi voluptas aliquid laboriosam aut voluptatem necessitatibus sunt culpa tempora iure qui est assumenda et saepe et corporis sit voluptatibus eos quis qui distinctio consequuntur distinctio reprehenderit minus veritatis minus et quo cum enim veniam saepe libero non iste impedit temporibus aut reiciendis dolores dicta ad soluta autem aut sed cumque cumque qui qui nihil natus optio ut ut est est et consequatur laboriosam pariatur ut neque nisi rerum non et aut nulla nulla amet odio sint reiciendis maiores omnis sint odit at corrupti est corrupti fugit ipsa aut deserunt sint aliquid occaecati architecto optio explicabo molestiae voluptatem quo sint aliquam quisquam praesentium quaerat ipsam sint ipsum reiciendis et et beatae ipsa quam repellat maiores ab aut veniam ut ut animi ea laudantium ullam deserunt nostrum voluptas et autem nesciunt consequatur inventore quas explicabo est qui sed dolor ut deleniti blanditiis quibusdam expedita qui et quos qui laboriosam voluptas similique rerum earum qui ipsa odit officiis eos ut similique quo repudiandae neque suscipit quos dolore eveniet dignissimos voluptate et sit recusandae quo velit totam quo aut sint veniam autem quo a ut cupiditate nemo et minima voluptas laborum rerum.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('409', '3', 'Autem repellat aliquam ad voluptatem ullam adipisci atque.', 'Eos expedita modi rerum dolore amet sapiente vitae dolorem vitae nisi distinctio doloremque et incidunt rem ipsam dignissimos nihil pariatur sed laudantium dolorum nostrum illum atque culpa ut earum nesciunt nemo tempora id sequi porro fugiat aut optio autem at deleniti eum aut nobis aut sit eum non cum id quia qui occaecati hic et asperiores perferendis consequatur odio voluptate tempora quod esse esse illum sit eveniet ipsum nihil et illum cupiditate alias et sunt officiis dicta in rerum nobis dignissimos quos quisquam vel illum dolor minima quo excepturi quia est rerum delectus dolorum tempore earum vel vitae eaque reiciendis iste libero consequatur quam corrupti inventore magni tenetur sequi eaque cum a reprehenderit architecto laborum quos et optio nihil nostrum quaerat perspiciatis doloremque error ut ea et consequatur accusantium voluptatem iusto qui dolores odit quam aut aut id autem praesentium iusto molestiae est sunt harum laboriosam et et laboriosam et quod id nihil porro fuga quam quis unde dolor atque possimus ut voluptas id maiores et doloribus vitae nostrum tenetur omnis dicta sed sint rem non aut voluptas et officia debitis sit neque modi sunt cumque et veniam dolorem fugit enim necessitatibus sed nisi id qui quos quod quisquam perspiciatis eos dolore quisquam nesciunt quaerat ex quam rerum adipisci voluptatem voluptas tenetur aliquid maxime quibusdam porro voluptatem corporis vel et doloremque dolor perspiciatis nostrum qui quia autem et dicta consequuntur et accusamus quam dolores error.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('410', '8', 'Culpa mollitia fugit illum ullam et quae sed.', 'Nisi ipsam perspiciatis repellendus dicta voluptas cupiditate tempore quia quo ipsa hic exercitationem pariatur est enim a praesentium et illo laboriosam quis hic et omnis eveniet unde hic eligendi et magnam nihil ad esse quisquam fugit esse id voluptatum ullam ratione iusto rerum natus quaerat ex ut consectetur nulla cumque dolore exercitationem fuga illo doloremque quia qui reiciendis aut qui eaque eligendi et sint et dolor eos inventore quaerat repudiandae qui distinctio et rerum totam est fugiat similique ullam blanditiis qui vel iste quia ea iusto voluptate hic voluptas et maxime assumenda dolorum quam voluptas soluta voluptatem quis corrupti sequi eligendi perspiciatis odio qui dolor ut sunt ex nemo modi voluptas quos explicabo voluptas atque nesciunt omnis delectus velit nisi aut officia sunt est quis eum eos quidem sapiente sint laboriosam quo voluptatibus voluptate ea sunt sint qui non aut ipsum non quia et nesciunt debitis tempora est accusamus nam odit quia aut dolor ipsum delectus repellendus occaecati ex maxime rerum aperiam non ipsum iure cumque tempora non amet et amet ut aperiam qui pariatur dolorem et eaque est aut occaecati aut expedita eum voluptas et quibusdam aut est qui doloremque repudiandae quia sit quia unde voluptas eius magni quibusdam occaecati totam quas sunt dolor aut voluptate ut est iusto dicta repellat amet non voluptas nostrum cum vel distinctio placeat officiis et maiores praesentium est sapiente debitis nihil modi quibusdam explicabo qui ea ullam illum tempora ea rem consequatur repudiandae et dolor ex quaerat sed omnis est quia id provident inventore rerum quam ut quis blanditiis aspernatur et ullam sint corporis dicta quod tenetur et molestiae qui adipisci voluptas vero et non hic recusandae et vel ut nemo porro vel aliquam repellendus impedit repudiandae cumque dolor id vitae delectus porro adipisci eveniet incidunt deserunt voluptatum rerum quae ut rerum dicta quibusdam dolorem quas dolore quam tenetur illo voluptatibus ut magnam perferendis aut tenetur dolorum non non quas dolore rerum facilis fuga rerum est maiores sit aut quisquam fugiat placeat perspiciatis incidunt voluptatem nam atque sunt consequuntur distinctio rerum veniam officiis quo doloremque dolorem est numquam voluptas voluptatibus debitis laudantium iure iure quo sint reiciendis soluta aperiam rem beatae quidem earum voluptatem.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('411', '5', 'Quia aut sunt delectus impedit ab esse explicabo.', 'Et atque id autem temporibus et quam quam sed tenetur sunt vel voluptate voluptatum sunt impedit placeat quisquam quia sed dolorem sit modi rerum asperiores numquam impedit non necessitatibus ducimus qui ad et ut voluptas est nemo impedit nesciunt unde hic natus eligendi facere ut natus mollitia aspernatur quaerat omnis ut tenetur sed et aliquam velit maiores harum ea qui optio explicabo aperiam ab nisi officiis doloribus voluptas blanditiis repellat vel quisquam omnis architecto sed earum ut in doloremque sit qui sed provident dolor aut et cupiditate eius consequatur aut nisi sunt eveniet ut porro architecto rerum nihil reiciendis est omnis rerum eos aperiam alias ex temporibus similique aut quo sit tempora exercitationem et reprehenderit modi non velit doloremque natus reiciendis et ut sapiente totam debitis est maxime dolores nesciunt impedit nihil doloribus et modi ut aut cumque dolorum sit corrupti cupiditate mollitia porro esse debitis sint dolorem sed enim rerum beatae sed expedita tenetur vero ipsam eveniet quaerat sed deleniti rerum quis aut dolorem error cum repudiandae sint ea optio similique aut eos velit doloribus fuga maxime ut molestias non assumenda est voluptas molestiae laudantium aut corrupti omnis odio eius eum error qui voluptatum impedit cumque est nisi maxime quidem veritatis aut qui aut voluptas voluptatum sunt.', '1', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('412', '7', 'Quasi esse aut fugiat rem.', 'Eligendi nulla vel est voluptates sint natus aut eaque aut praesentium sed autem dolorem at ut laudantium error aperiam voluptas voluptatum animi quia sit tempore qui corrupti et consequatur itaque debitis nobis ducimus in doloremque doloribus nisi et harum odio est occaecati commodi laborum ex sed et quibusdam enim quia hic delectus sunt nihil id fugit reiciendis laudantium libero minus suscipit consequuntur assumenda laborum error facere beatae velit et sunt et itaque occaecati eligendi deleniti velit qui at eos qui velit vitae reiciendis quasi dolores quas consequatur molestiae et fuga deleniti omnis minus quos in nesciunt omnis vitae autem consequatur molestias aliquam asperiores repellendus commodi in fugiat dolorum sed itaque qui sed ex sunt ut illo ut laboriosam numquam illum alias commodi autem minus ea ipsum numquam magnam aut aut cum mollitia explicabo et quod aperiam cum commodi qui quo qui ut dolor et sed est eum nobis quisquam debitis quam at est odio consectetur maxime non rerum et alias dicta aut architecto commodi eos non quaerat rem et et non velit in itaque iure odit corrupti quo vero maiores voluptatem fuga impedit ea aut iure qui eum eum recusandae qui nisi omnis ad est numquam et illo dolorum ullam qui odit natus aliquam qui expedita qui architecto eaque quasi quos rerum sequi non labore ea quod deserunt esse velit in sed repellat fugiat voluptatem porro ut et placeat est reiciendis et et voluptatem ut consequuntur facere non deleniti perferendis tenetur explicabo dolores quam rerum qui et quis cum aut omnis quia quia quae velit eius dolorem culpa aliquam illum quos cupiditate iure quidem et qui temporibus saepe quos cumque deserunt ducimus dolores quaerat quo qui quos qui eum ut doloribus iste voluptas repellendus eum ex aliquid amet ut et autem officiis aliquam unde explicabo consequatur eligendi ea voluptas incidunt dolores natus repudiandae labore ad aperiam rem dignissimos alias in tempore sit unde consequuntur itaque consequatur molestiae ullam consequatur dolor assumenda reiciendis et consequatur temporibus ab fugiat quas nemo culpa aut ea non iusto qui accusamus beatae et sed distinctio necessitatibus saepe perspiciatis voluptates nihil debitis quo est nulla neque itaque nihil et voluptatem corrupti omnis iusto repudiandae eos facere mollitia molestias qui optio mollitia tempora sed praesentium laudantium consequatur pariatur quae assumenda atque commodi non totam qui voluptatibus commodi velit eos porro nostrum error sequi earum magnam aut et laudantium deleniti sit ut vero qui vitae laborum occaecati non veritatis accusamus quam est aperiam id possimus aliquid earum ea eligendi nesciunt commodi iste nihil.', '1', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('413', '10', 'Culpa et aspernatur et non enim in.', 'Vero ullam at neque eum nihil quo ut eos velit tempore aut fugit dolores illo ipsa deserunt enim voluptas tenetur dolores aspernatur inventore vero numquam ipsam est architecto nisi dolor distinctio est fuga voluptatem architecto laudantium et et ad nisi iste ullam reiciendis harum id nam asperiores quis distinctio blanditiis quae aliquid sapiente et est porro similique ad mollitia quibusdam aut cum aperiam eveniet eos ut sint veritatis ut quos quia consequatur omnis minus quia exercitationem at ullam quas vero perspiciatis nihil voluptas cupiditate distinctio laudantium at delectus cum ipsam facere quisquam iusto doloremque fugiat ducimus tempora quam ipsam aliquid id ut quo voluptatum eligendi quo consequatur porro quia autem iste est veritatis recusandae et reprehenderit placeat tenetur repellat rerum praesentium magni unde optio dolore labore praesentium corrupti rem maiores corrupti cum ut saepe aspernatur mollitia et eos aut rem laudantium nam tempora commodi temporibus dolor dolorem dignissimos ipsam tenetur ut mollitia cum dolor natus ratione dolor deleniti delectus quas sapiente aut quod illum qui aperiam dolor aut expedita praesentium fugiat enim inventore facilis autem tempore molestias fuga consequuntur minima voluptatem numquam eos quae aut dolores pariatur id sed ipsa sint non veniam quis voluptas atque quis maiores expedita sed enim placeat sint eveniet modi minus dignissimos placeat magni molestias nam eos aperiam facere voluptas doloremque necessitatibus assumenda consequatur repellat aut ut beatae sequi quis laboriosam neque sit exercitationem consequuntur delectus quod recusandae saepe sed et impedit animi in et inventore omnis est est velit distinctio accusantium quaerat magni provident ipsam deserunt quidem adipisci iusto sed eum enim qui consectetur facere ut occaecati nulla laboriosam porro itaque cum et ducimus accusamus blanditiis laudantium ipsum nemo doloribus harum nulla sunt non qui aperiam et voluptas atque error autem expedita quis enim accusantium ex ex in repellat laborum voluptatum fugit vel blanditiis quo et et quia voluptatibus natus saepe magni et nesciunt voluptas sed non ut pariatur odio eligendi et doloremque culpa modi cum et consequatur rerum incidunt aut rerum voluptates adipisci et vel voluptatibus minima quia aut dolorum quia quisquam harum blanditiis iste id aut omnis enim cumque nam quasi minima consequuntur quia error deleniti aut et labore ea quos temporibus iusto velit facere saepe cum sequi aut doloribus id quidem labore porro qui assumenda voluptatem repellendus quam sed cumque commodi totam voluptas mollitia ratione aut porro accusamus voluptatem qui veritatis et voluptatem accusantium fuga beatae voluptatum impedit corrupti dolor rerum ullam adipisci nesciunt placeat at necessitatibus.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('414', '6', 'Est suscipit laboriosam explicabo et iste qui velit.', 'Eum temporibus rem quidem explicabo consequatur delectus quo nihil rem earum et ut quod accusantium facilis et sit veritatis amet voluptas sed culpa qui ab quia excepturi sed qui delectus voluptas quia nisi sit vel sint omnis explicabo porro non itaque cum illo voluptatem temporibus atque nam rerum autem culpa quia quod blanditiis animi excepturi voluptate repudiandae reprehenderit maiores amet et impedit ab dolorem voluptatem placeat eos quisquam assumenda vel atque quo officiis aliquam dolor nostrum est dolorem ut ullam consequatur labore et perferendis magnam enim quod explicabo ut quas ut et in quisquam maxime quasi tempore officia ut excepturi tempore omnis hic et necessitatibus sapiente aliquam laudantium pariatur adipisci rerum repellendus exercitationem eaque eum qui amet quidem cumque dolorem neque consequatur omnis id perspiciatis nam consectetur ut culpa distinctio dolore optio sunt nam eaque modi eum esse reiciendis rerum quasi asperiores ut voluptatem qui magni totam quis eius nam deleniti aut labore eveniet quod omnis cupiditate possimus voluptatem repellendus adipisci est et eum ab dolor ipsum similique aut cumque vero dolore temporibus eos et totam voluptatem sed minima facere officiis minus culpa explicabo quia odio fugit aut mollitia est ut laudantium illo dolores quod cumque sint vero minima eius ut omnis harum sed magni tempora et et et delectus esse inventore sit quo nesciunt quod ex omnis magni consequatur ipsam hic temporibus reiciendis et rerum ducimus laborum ut fugiat quo ea amet repellat dignissimos fuga deserunt et unde quia aliquam aut qui aut qui molestias nemo ipsam pariatur enim quis officiis vitae et error soluta porro tenetur laborum et et aut omnis rerum quis repellendus omnis veniam magni porro et rerum voluptate reprehenderit aut fugit nesciunt odit quo enim dolorem voluptatibus et culpa totam soluta quia ducimus odio totam dolor et quia enim dolores placeat quidem vel voluptates rerum adipisci ex expedita nam nostrum magnam autem et vel aperiam delectus repellendus eos qui voluptatem ipsum sunt repellendus nihil reiciendis blanditiis aliquam quibusdam occaecati quia non inventore aliquam aperiam aliquam mollitia voluptatem sapiente illo accusamus doloremque eligendi quasi et soluta quis dicta fuga optio ut culpa aut et numquam omnis dolore eligendi voluptas placeat eos voluptas nulla vel mollitia qui harum dolores non illum perspiciatis et laudantium veniam qui odit beatae neque vero provident optio sed eius hic eius sunt et non voluptatem laudantium omnis consequatur nihil provident dolore unde cupiditate illum qui veniam sint error aperiam minima ut ut adipisci atque cupiditate harum nesciunt laudantium itaque dicta est sit ea expedita.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('415', '1', 'Consequatur id consectetur mollitia quis dignissimos velit possimus.', 'Reprehenderit aut repellat dolore vel enim quos et velit dignissimos dolorem sed qui hic illo deserunt amet distinctio in eum eos molestiae modi dolorum beatae debitis eligendi in eveniet quos corrupti rerum sint aut id adipisci et ratione sint quae suscipit vitae ut doloremque nisi voluptas in animi placeat autem dolores ratione culpa itaque et ratione esse non voluptatem eius provident vel sapiente ut sapiente consequatur soluta non expedita dicta amet possimus quia quae fugiat unde aspernatur animi cum quas est aut non et et quae minus a dolorem architecto earum laudantium ea cum qui atque distinctio distinctio sunt dolorem sequi ut accusamus labore mollitia blanditiis laboriosam et perferendis quia tempore corporis distinctio exercitationem sapiente et facilis eaque nobis quasi assumenda iusto doloremque culpa enim debitis et at blanditiis soluta consectetur repellat eum maxime officia saepe dolor sed ad in rerum provident iste culpa in quo esse et dolorem cum sint quia illo non delectus nam aperiam ut distinctio voluptatem nobis mollitia dolor dolores nisi occaecati ut sit quo sit eos magnam eum ut explicabo consequatur voluptas eius ab quasi dolor ex cumque repellat incidunt ipsa rerum non ipsa sed non et officia harum quaerat nemo eum sit ullam ut autem ab quisquam distinctio ullam aut omnis sapiente voluptas nihil libero incidunt numquam provident aperiam fugiat ratione deleniti accusamus cum doloribus consectetur temporibus sint exercitationem architecto blanditiis esse quo maiores placeat necessitatibus alias similique labore inventore commodi eos et tempora ipsam repellendus id in facere officiis nisi exercitationem assumenda quas hic accusamus qui quibusdam veritatis maxime et sunt cum sed voluptatem est impedit sunt inventore dicta laboriosam ipsum officiis impedit illo aut quia explicabo quis et modi repudiandae quasi vel accusamus sunt modi maiores harum sint pariatur et nihil voluptatem quos esse dolorem mollitia voluptate aliquid magni optio alias eum eligendi aut aut necessitatibus eos nisi dolor eum neque mollitia repudiandae et dolores sequi corrupti dolorum sequi modi ipsa dolorem reprehenderit esse et vel deleniti ab ut laboriosam nisi tempore natus dolor cumque qui quasi qui animi optio consequatur debitis minima ea neque deleniti aliquam expedita cumque veniam dolor in atque non vitae aperiam quam nulla non minus nulla sed velit voluptatem accusantium molestias et blanditiis quaerat ut laudantium voluptates accusamus voluptas repudiandae nesciunt atque autem officiis dignissimos nihil illum sed aut ut voluptatem sit quos quisquam labore quas perferendis voluptatem est sunt et dolore sit ipsum expedita necessitatibus reiciendis ut et alias rerum sed recusandae occaecati et repudiandae fuga ut quia natus ut atque.', '1', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('416', '1', 'Quasi ut molestiae quas a saepe omnis.', 'Necessitatibus enim illum beatae dicta totam sit autem ipsa cumque voluptas voluptatum velit id non et odio sint soluta omnis est et eveniet quaerat laborum tenetur rerum alias ea ut debitis non qui aperiam aspernatur nemo iste rerum perferendis facere quam mollitia nostrum quasi minima totam modi tempore magni qui iste blanditiis totam neque excepturi pariatur sunt voluptatem neque quos et nobis laboriosam pariatur ut dolorem doloribus in reiciendis culpa corrupti autem ut ab et ut recusandae maiores quaerat consequuntur aperiam sint in neque ut sit non sunt aut aspernatur deleniti porro non nam nulla expedita quas et voluptatem voluptas a quo qui ipsam non qui asperiores esse deserunt iure quo voluptates eos enim ea vel nemo laudantium exercitationem et sit odio nisi enim et saepe veritatis sint ab sint officia numquam dolor tenetur possimus odio quis voluptatem ut nemo nihil rerum et et dolores ipsa doloremque veritatis quasi quis ut qui aliquam repellat corrupti et fuga doloribus perferendis laboriosam doloremque autem rerum dolorem at et totam omnis tempore vero voluptas ullam qui excepturi porro recusandae et ea quae eos ipsam placeat doloribus quo ut reprehenderit laborum autem eum tempore reprehenderit excepturi quia eum laboriosam nostrum molestiae sed illo quia aspernatur eligendi optio animi cum autem eaque nemo voluptatem et repudiandae consequatur deserunt neque et quia provident fuga explicabo non autem nemo libero occaecati ratione non alias quia impedit quidem nihil molestiae ut officiis odit mollitia adipisci nulla officiis eos illum consequatur soluta enim quae aut earum libero praesentium sed soluta quae deleniti consequuntur recusandae nostrum temporibus aspernatur aliquam facere aut ad itaque nemo expedita atque rerum illo harum eaque nemo necessitatibus autem molestiae eum autem quos et nulla soluta dignissimos ipsam modi pariatur amet debitis ut quas nostrum in iure quia at omnis consequuntur necessitatibus qui quia aut perferendis explicabo nesciunt aliquid iure asperiores beatae dolorum tempora sint molestiae voluptas consectetur vel modi quo mollitia voluptatem quas accusantium suscipit aliquam enim ut vero hic fugit enim rerum molestiae sint dicta ut modi eum fugit qui aut voluptas sit vel labore delectus autem odio rerum natus quia accusamus soluta sit vel et exercitationem rerum provident cumque fuga hic non earum commodi minima qui illo quis laboriosam illum voluptatem consequatur a quam ipsam occaecati ea et provident expedita quos porro non nesciunt aliquid in et sequi.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('417', '10', 'Iste qui atque cumque officia modi et nulla.', 'Quibusdam quia quasi eligendi pariatur non modi ut consequatur doloribus reprehenderit dolore cupiditate quos nihil natus incidunt in dolorem maxime dolorem occaecati placeat maxime optio quidem nulla nam laborum id non cupiditate nihil quam exercitationem voluptate et in et animi nihil ex quos qui ipsum illo consectetur nisi perferendis quis rerum est quidem qui quia dignissimos doloremque quas explicabo laborum consequatur eius impedit rerum aut architecto molestias omnis dolorem beatae quam dignissimos ea aut error pariatur velit quibusdam at in est sint aut ullam maiores debitis quis id voluptates maiores ab eligendi aliquam et totam suscipit nam dolorum iure maxime aut et dolorum aut voluptatum et quia quae est accusamus quis ratione ullam id reiciendis sint libero repellat quidem illum nihil cum ratione quis voluptatem consequatur numquam eum est fuga quos velit rerum voluptatem dolorum aperiam consequatur quae est molestiae deleniti et dolores sit molestias quasi rerum autem ex aut est et voluptatem ea id accusamus quo sed eos ad alias dignissimos delectus et odio sed ea et corrupti eum vel sit voluptatem consequatur qui omnis inventore dolor nesciunt voluptatibus debitis fugit in maiores vel explicabo voluptatum dolore magni consequatur pariatur et atque dolore veniam consequatur molestiae velit occaecati esse vel ut ex voluptatum autem qui aperiam vel nemo numquam rerum laboriosam tenetur et temporibus aut tempore incidunt magnam consequuntur animi iste neque tenetur voluptatem aliquid delectus quaerat necessitatibus dolore nemo nihil nostrum animi neque accusamus numquam minus quibusdam quia maiores quia quo quis nulla dicta voluptatibus dolor nesciunt ipsa ratione magni distinctio consequatur expedita placeat et in optio est fuga sed consectetur et tempore ea qui nulla nesciunt nisi eum quidem illo non autem laudantium ut et numquam atque deleniti voluptatibus cum minus natus rerum unde consequatur impedit impedit tenetur odit repudiandae enim tempore dolor nostrum et inventore aut pariatur.', '1', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('418', '7', 'Voluptatem dolorem consequuntur culpa qui.', 'Qui sapiente minus veniam ut eos est dolorem nihil nam possimus voluptas vel labore et ratione saepe quia consequatur quia molestiae et voluptatem possimus beatae et aut consectetur accusantium quia laudantium dolorem quo labore nulla dolores harum dolore accusamus similique nostrum deserunt nesciunt quibusdam enim non dignissimos quis fugit nulla perferendis tenetur explicabo cum ipsam placeat similique corporis in facere rerum voluptas sapiente enim voluptatem adipisci voluptates beatae nemo accusamus et vel qui veritatis vel ratione possimus neque aperiam error dolorem ab molestiae voluptatibus dolore fugit et quo suscipit nam dicta quae debitis impedit earum illum voluptatem quia architecto quod eum tempora illum similique quis fuga voluptatem dolor et quia iure facilis totam voluptas est illum quis doloremque reiciendis et explicabo aut in eos perferendis et tempora reprehenderit voluptates adipisci rerum facere aut et in impedit a vel facere illum esse tempore voluptates dolores eaque dicta ratione quasi debitis ea alias labore voluptates quasi excepturi unde deserunt eum aut quidem in reiciendis et aperiam atque consequatur inventore excepturi recusandae fugiat vel itaque perferendis quae incidunt molestiae nesciunt dicta rem asperiores quasi perferendis recusandae error quis quasi et ipsam vel tenetur amet dignissimos sit esse quas tenetur ut cumque ut a qui neque qui quia non sed saepe ut est consequatur enim aut earum aspernatur est aliquid consequuntur vitae neque ipsa commodi accusantium quibusdam ut voluptas odio in molestiae corporis vel omnis libero similique incidunt facere expedita voluptas est omnis laborum voluptas impedit tempore dolor corporis eum ab sit ab autem perferendis est ipsum id nihil similique voluptate eius et aspernatur sed reprehenderit animi saepe quibusdam maiores et a quia iure non quibusdam doloremque est ut vel adipisci minima voluptatem sit accusantium qui sit vel et et quis ipsa eaque numquam ad perferendis magni voluptas molestias reprehenderit aliquam quia est ea perferendis blanditiis voluptas voluptatum cupiditate necessitatibus non est quibusdam nulla eveniet molestiae dolorem quibusdam culpa aliquid quod quia et hic unde fugiat dolorem dolorum aperiam suscipit voluptas voluptatem illo velit magni illo possimus modi non aliquam alias a numquam atque expedita et nobis perferendis enim incidunt sit hic non cum repudiandae nemo cumque cum dolores natus temporibus dolor ipsum esse qui vero quia et dignissimos illum nostrum quis assumenda repellendus debitis ut iusto officiis possimus consequatur.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('419', '3', 'Labore magni quis corrupti magni quo quibusdam.', 'Voluptas tempora et sed dolor commodi voluptas rem maiores aut cupiditate dolores provident ullam consequatur sint voluptates est ipsum soluta qui at quas eum eos voluptatum et minima ut quas eum maiores laboriosam neque voluptate est nam sapiente facilis deserunt qui qui harum qui porro minima officiis eos praesentium iste aut explicabo iste aperiam laborum sit consequatur id cum est ut voluptatem et provident voluptatem quidem eum repellat officiis et inventore nostrum quam voluptate quo et consequuntur provident ut minima velit ipsam saepe neque quia expedita est fugiat adipisci quia ad quos molestias ut unde illum ipsa illum molestiae exercitationem magnam pariatur nam ipsum sit natus quibusdam eos possimus harum corrupti id repellendus necessitatibus rerum incidunt suscipit laborum eos earum distinctio voluptas illo illo et reprehenderit laborum recusandae fugit laboriosam alias quidem rerum nisi ut et mollitia fuga numquam excepturi saepe excepturi ipsam aut voluptates molestias rerum id reiciendis hic ullam totam dolore quia ut odit culpa nulla ad incidunt earum sint quaerat qui sunt officia optio totam et omnis pariatur suscipit voluptatibus qui occaecati in dolores est soluta repellendus repudiandae hic molestias quis nihil corrupti dolore occaecati maxime quis voluptas fugiat unde consequatur dolorem est non eum vero voluptas adipisci at in et pariatur dolorum nihil atque vero voluptatem enim nihil minus ut qui et magni cupiditate in id aspernatur asperiores voluptatem repudiandae minima nihil est consectetur quibusdam aut quod voluptatem aut consequatur id aut qui voluptate consequatur sit pariatur itaque exercitationem sint labore id incidunt repellendus quo rerum placeat tempora et soluta expedita veritatis quia similique veritatis rem commodi sit amet saepe et quis vero dolores facilis at et blanditiis vel non et est error non maxime aspernatur modi reiciendis blanditiis fugit et sapiente incidunt sint neque porro qui placeat ut qui eius expedita tempore ratione ut soluta et consequatur cupiditate iusto eveniet quia sit enim nulla in aut aspernatur minus maxime exercitationem quis sapiente alias consequatur expedita asperiores ipsum quia eius non sit praesentium animi quia rerum sint voluptatum consectetur eveniet magnam ut quia et ut minima aut fugiat ad et non qui.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('420', '5', 'Voluptatem quidem hic corporis odit sed eaque.', 'Repudiandae provident iste quidem dolor aut nihil vitae accusamus quis repudiandae beatae non aut tenetur eos est consequatur est tenetur excepturi aut voluptatem voluptatem fugit architecto atque et quaerat et repudiandae libero nam inventore occaecati doloribus ullam architecto commodi fugit minima magnam voluptates amet et reprehenderit sit ipsam et nam dolores asperiores sunt et esse quidem magni vitae architecto hic dolorem aliquam sed fugiat facilis ad quia accusamus explicabo sint nostrum consequuntur fuga voluptatum accusamus corporis magni nihil voluptatem debitis accusantium voluptatibus optio nobis ullam vel ut reiciendis fugiat eius illo sequi hic sapiente soluta ut est harum aut iste recusandae quidem dignissimos sit laudantium cumque est expedita vero et non maiores facilis voluptatem est quis qui et veniam voluptas molestiae fuga rerum et enim nam voluptate provident ex voluptatem deserunt sequi repellat nesciunt neque amet odio qui corporis quasi fugiat libero rem est ducimus fuga adipisci commodi omnis numquam temporibus et aspernatur quaerat id dolore aut aut amet porro velit nihil eos explicabo et voluptatem assumenda aliquid molestiae neque consequuntur voluptate doloremque excepturi rem eligendi voluptatum nisi sunt et adipisci quia voluptatem officia et consequatur ullam ipsam animi quia ut molestiae rerum dolore aliquam sit omnis accusamus incidunt repellat perferendis vero harum nesciunt optio non ad ut dolores iusto labore ut sit laboriosam expedita non non sunt ea sint.', '1', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('421', '5', 'Excepturi saepe in aspernatur exercitationem.', 'Sint eaque aut qui incidunt assumenda ut nesciunt et consequatur recusandae praesentium veniam et optio repudiandae molestiae id libero voluptas sit molestias ut eveniet incidunt laboriosam et minima assumenda non occaecati molestiae temporibus facere explicabo cum architecto perspiciatis est est dolorem provident rem illo temporibus sit quam nobis natus praesentium ab harum est dolores tempore ab enim cum provident aliquid molestiae doloribus fugit neque amet quia deserunt voluptatum aut iusto mollitia in recusandae ut ex eveniet necessitatibus est magnam illo necessitatibus quisquam qui nemo eos deserunt exercitationem atque laudantium doloremque illo sunt porro quae qui dignissimos aliquid saepe deserunt eos omnis voluptatem iure corporis et veritatis consequuntur quia alias a amet sed veritatis blanditiis voluptas rerum praesentium eos corrupti debitis distinctio mollitia quia tempora ut maiores beatae consequuntur aut nulla ad in nam voluptas aliquam voluptas provident perferendis qui rerum quaerat voluptatem quis enim est non voluptatem numquam aut saepe ex quia nostrum sunt facilis repellendus odit sit illo voluptas aperiam illo repellendus et facilis dignissimos aut at ipsa molestias et sit necessitatibus non unde rerum voluptatem earum fuga ut magnam voluptatem accusantium aspernatur consequatur ab aperiam quibusdam hic ipsam et odit officia quo quas fugit ab sunt dolor pariatur saepe nihil aut harum dolorem iure voluptatum voluptate officia laborum odio vel est ea itaque nulla et eum asperiores cumque voluptatem autem vel quaerat quia omnis repudiandae est quos dolor voluptas accusantium.', '0', '2017-05-02 22:59:08', '2017-05-02 22:59:08');
INSERT INTO `course_news` VALUES ('422', '10', 'Sit quo eveniet eaque facilis molestiae animi ad.', 'Autem quibusdam sed deleniti ad quibusdam rerum amet omnis et labore non eos est occaecati in iure et dolorem neque rerum possimus quidem voluptatem perspiciatis et fuga ad natus dignissimos magni laborum inventore possimus placeat ut quasi explicabo nam eveniet ipsam voluptas ea deserunt sed eaque sed sint officia tempora sint autem consequuntur ad eius quas fugiat id debitis quas vitae quam voluptas earum iusto facilis sunt tempore necessitatibus consequuntur sunt at quaerat sunt qui sit et inventore excepturi laborum dolore ad et suscipit labore quibusdam velit ab ab sit dolore illum ut est occaecati consequatur facere iste culpa est hic neque quo incidunt accusantium veritatis alias iure optio reiciendis rerum eaque laborum dignissimos error ad praesentium eos accusantium in qui nam id ut autem consequatur dolores modi maxime voluptatibus nemo laborum quis autem architecto qui quam consectetur nemo velit blanditiis quidem quis et aperiam nam modi recusandae voluptatum id consequatur id recusandae cum esse totam sed voluptas nemo ad magnam id quia sit qui quis ratione quis sed vel perspiciatis omnis nihil qui molestiae deleniti repudiandae voluptates quibusdam possimus et excepturi mollitia dolor dolores itaque ut illo in consectetur minima nisi vel.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('423', '7', 'Commodi vitae et eveniet nihil repudiandae assumenda labore.', 'Odit reiciendis quod et necessitatibus pariatur modi sequi et perferendis ut deserunt dolore est ea natus recusandae ut voluptatibus modi qui nemo reprehenderit iusto eum odit quaerat et reprehenderit quaerat architecto voluptatum quo qui voluptatibus ullam quia accusantium hic minus alias excepturi quo architecto eos ab exercitationem sint earum sed ipsam sint est non est architecto voluptatibus atque sed labore vitae id facilis molestiae molestiae repellendus harum similique nisi voluptas sunt accusantium consequatur ut dolores dolorem quia fugiat voluptas quaerat occaecati magni est ut quo et voluptas molestiae atque doloribus molestiae commodi quasi natus porro temporibus vel adipisci veniam molestias at ab repellat velit voluptatem consectetur minus fugiat a ratione sint voluptatem possimus et ut eos asperiores et sequi nulla molestiae placeat recusandae nemo fugit officiis qui enim cumque voluptatem molestiae quisquam accusamus reprehenderit error eveniet ut fugit quo occaecati ut consequuntur autem ex autem voluptates eius velit excepturi illo et repellat accusantium ut ullam et quam dolor ipsa nostrum quaerat ducimus hic necessitatibus exercitationem id ipsum sed illo perspiciatis quo nobis repellat error corporis sit modi molestiae ut sed cum rerum recusandae debitis a dolores non ipsa numquam explicabo laudantium sit error molestiae ullam rerum enim itaque maiores aliquam quisquam modi harum quisquam ullam fugit dolor totam explicabo voluptas natus accusantium qui nesciunt est iusto odit maiores cumque perspiciatis in quis perferendis quae corporis quia quia non facere quos quae nihil quam omnis praesentium doloribus accusamus sed provident inventore nesciunt deleniti perferendis unde perferendis quisquam enim aperiam quis laboriosam et maiores perspiciatis ad nihil expedita soluta voluptatum aut blanditiis atque libero odit veritatis consequatur ut dolores et sit voluptatem quod quis labore enim dolorem quibusdam et est laudantium quasi facilis distinctio blanditiis.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('424', '5', 'Ex qui sunt ut sit ut quam.', 'Ipsam eligendi et corporis eveniet nihil vitae optio aperiam consequatur eum quos recusandae maxime eius blanditiis doloremque quasi temporibus quaerat vel qui vero reprehenderit iusto consectetur quia optio qui sequi iste culpa illo ullam laborum et dolor omnis aperiam facere quasi molestias voluptate recusandae est aperiam qui labore nesciunt libero pariatur temporibus iste commodi repudiandae eos eos ad ad doloribus et saepe dolorum reprehenderit voluptatem illo maiores sunt id earum vel non officiis ut nisi ipsam ut qui aut repellat rem assumenda occaecati delectus quaerat voluptatum maxime et culpa rem distinctio harum tempora sit a laboriosam omnis soluta quae nostrum et numquam provident quia a ut quis nesciunt aliquid aut qui laudantium soluta laboriosam eos hic nisi repudiandae voluptate quos quaerat eveniet quas optio natus iure ut sed praesentium porro occaecati magni ipsa quibusdam est rerum aliquam ducimus sit veniam itaque tempora sunt occaecati ducimus sint tenetur nobis perspiciatis ut molestiae quia molestiae maxime repellendus dignissimos natus occaecati voluptate nulla et est eos soluta ipsam alias molestiae nostrum officiis tempore sit ut minus dolorem nostrum iure sed et eum est temporibus dicta ipsum expedita sit saepe ratione repudiandae aut maiores cupiditate tempore id sint et suscipit.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('425', '9', 'Eius voluptatem id qui quo eveniet tempora aliquam delectus.', 'Ut tenetur accusamus consequuntur ut qui praesentium ex minima rerum dolorum harum quod ipsam quo voluptatem aut distinctio corporis facere commodi et accusantium doloremque nemo soluta eum est ex repellendus a quo omnis aut sapiente tempore aut est perferendis officiis est quo minus recusandae quia fuga qui et placeat eum et doloribus quam molestiae et occaecati doloremque mollitia animi reiciendis voluptatibus rerum voluptatem aut et voluptatum sed fugiat voluptatem fugit quaerat et expedita dolore est odio ut tempore qui rem perspiciatis error sapiente inventore debitis dolorem nobis sed dolores ipsa distinctio in cupiditate sed est ut voluptatem occaecati ut nemo blanditiis ipsum deserunt culpa officia saepe quisquam doloremque voluptas adipisci mollitia sunt dolorem impedit et non dolore rerum est fuga incidunt dolores voluptatum vel facilis ea quo est doloremque repellat et aut reiciendis omnis sit sint rem quas ipsa velit sed reprehenderit tempora quibusdam aperiam possimus quia similique aperiam numquam minus eaque culpa maiores et natus beatae esse voluptatem ut voluptas corporis exercitationem nostrum perferendis reiciendis et pariatur laudantium quia incidunt rerum repellendus eos est asperiores perspiciatis rem aliquam hic velit aspernatur ex sequi neque et in eius facilis magni rerum dolor et incidunt autem mollitia laborum qui inventore.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('426', '8', 'Quaerat ipsum laborum necessitatibus laudantium et.', 'Blanditiis eveniet quia nemo repellat dolor quibusdam porro nesciunt dolores pariatur enim ut qui labore placeat ut adipisci fugit sunt voluptate perferendis sed est possimus sint autem sequi rerum aliquid cupiditate similique id porro qui qui qui aperiam amet adipisci voluptas aspernatur molestiae quibusdam provident sapiente vel necessitatibus illo aut pariatur sunt quibusdam sapiente nostrum ut consequatur eum reprehenderit soluta deleniti quam est voluptas nulla iure modi cum commodi exercitationem consequatur debitis sequi nihil expedita eum aliquid architecto tenetur quia voluptatem quia aspernatur quae porro nobis quam corporis qui ipsa modi quis ullam ea provident dolor nihil ipsa deleniti quibusdam ut dolore et dolor voluptates corporis inventore velit reiciendis ut voluptate ab ducimus eum voluptas perspiciatis magnam aut totam vitae incidunt laboriosam cum facere harum quae maxime reiciendis eos dignissimos et omnis itaque in ullam facere reiciendis tenetur quis quasi voluptates voluptas aliquam consequuntur voluptate nobis voluptates quaerat similique consectetur ducimus magni doloremque cumque aut eos voluptates quos consectetur dolorem id porro nostrum sed ducimus at non veritatis sunt ducimus et quia molestiae est sapiente quis voluptatem sint odit ex explicabo explicabo suscipit est sit eos quaerat eaque expedita harum qui et error ipsam dolore qui et similique excepturi ut cumque aut non et dignissimos hic voluptas eligendi et temporibus dolorem consequatur quidem aspernatur laudantium repellat non hic eos ad reiciendis ut eum aut consequatur omnis quis consequatur tenetur est pariatur pariatur deserunt id aut voluptatem quis quia magnam enim ut non sequi quo quisquam perspiciatis eum et eligendi voluptatem excepturi hic et voluptas omnis unde mollitia rerum est eum minus dolores laborum quisquam suscipit id et et vitae quidem corporis ipsum blandit