INSERT INTO `course_news` VALUES ('427', '3', 'Nulla nobis occaecati vel.', 'Nesciunt non laudantium maiores beatae consequatur deserunt velit eos praesentium sed similique perferendis sed officia et soluta earum rerum maiores fugiat ea minima eveniet eligendi officiis dicta quidem corrupti rerum sit repellendus quasi adipisci soluta amet quisquam iusto quod odio est ut earum similique deleniti error rerum dicta cumque quas quasi id consequatur quaerat tenetur magni distinctio repudiandae laboriosam quibusdam sint temporibus quo ea sit suscipit expedita in explicabo est et labore ratione dolore et eos molestias ut ducimus accusamus omnis dolores voluptas earum doloremque maiores beatae vel velit ut tenetur ipsum eius dolore ut animi nemo dolores blanditiis ducimus qui ea ut magni nihil aut et ut id qui dicta eum assumenda deleniti nostrum veritatis vel non porro eum ipsam vitae quia dolorem aut architecto ea aut porro quia natus fugiat tempora nesciunt sint veniam eos beatae debitis doloremque vel dolor blanditiis non praesentium velit dolor ducimus expedita et molestiae sit asperiores alias hic id id aspernatur asperiores ipsam voluptatem voluptatem minima ut facilis occaecati adipisci iusto nisi fuga assumenda eligendi adipisci ullam libero aperiam optio neque itaque tempore incidunt nihil deleniti molestiae voluptas nesciunt consequatur aut fugit et dignissimos nemo ab quo voluptas maxime ad non est voluptatum qui ut odit magnam autem voluptatem et quia laudantium est accusamus hic veniam modi magnam quo ut molestias aut doloribus ipsam ipsum suscipit corrupti ut omnis aut eligendi corporis ut odio labore provident non odio in atque non aut vel quibusdam.', '0', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('428', '8', 'Et aut esse et voluptatem.', 'Ducimus ipsa voluptates pariatur neque quo odit sint est cumque illo ipsa eos quia in deleniti illum distinctio quia sed est iste autem adipisci sed velit quam libero pariatur voluptas et adipisci optio eos ad magni et nobis et illo voluptatibus animi voluptatum et id voluptatem odio ut mollitia repellat laudantium a rem quidem similique vel molestias laboriosam architecto esse at quibusdam sequi debitis fugiat eligendi at et in voluptates excepturi ea optio quae dolorem provident qui repellat reprehenderit quos tempora beatae nam explicabo repudiandae odit occaecati consequuntur ut nesciunt accusantium architecto aliquam est aut dolorem quos quam et itaque sit numquam ipsa in optio eos non consequatur rerum eligendi illo deserunt dolores vel error ex dolores corporis velit consectetur repudiandae rerum iure ipsam rem ut rerum dolor dolores aut quod et in ab in quia doloremque est quis natus magnam eum ratione non vel enim et libero aliquam et temporibus praesentium dicta omnis perspiciatis neque atque praesentium aperiam reiciendis explicabo quidem aliquam accusamus dolorem consectetur repellat tempora veniam ipsam veritatis nisi quae tempora nesciunt voluptatibus sit laudantium ea quae impedit porro corporis perferendis fugiat ex dolorum quasi sit aliquid a numquam ipsum sit dolores et perspiciatis quia distinctio blanditiis qui et consequatur nihil corporis ullam quo voluptas iure ducimus voluptatum officia quaerat quasi minus mollitia nisi explicabo quia odit autem non aut distinctio distinctio rerum sit placeat quo est harum nihil nihil amet expedita rerum deleniti est quae omnis omnis aut fugit qui eius eligendi in corrupti exercitationem quam sunt dolor quidem dolorem quasi quo nemo nisi aliquam dolor quos officia ut sed qui qui est voluptatem quo eum error autem deleniti quam placeat quia nulla beatae voluptatibus laudantium quam alias laudantium dolore eius incidunt sunt voluptatum