INSERT INTO `course_news` VALUES ('429', '2', 'Quisquam ducimus voluptatum quia in et non.', 'Rem esse nemo repellat omnis sed ut qui quia nisi delectus enim autem soluta aut quisquam necessitatibus id eos placeat pariatur eveniet debitis cupiditate nostrum est ea nesciunt dignissimos quis commodi ratione natus deserunt vel voluptate incidunt facere beatae dignissimos officia numquam deserunt quae unde cupiditate repellat eaque nemo ad molestiae aut dolore dolores aut illo quidem voluptate itaque totam iste recusandae tempora earum mollitia aut ullam rerum accusantium eius officia ut eum ut perferendis repellat at ad amet optio architecto voluptate nulla dolore quis consequatur itaque nemo expedita molestias sint nihil nobis voluptatem officia ratione possimus eius non ut voluptates est ducimus similique eaque dolorem minus quidem voluptatem explicabo fugiat fugit quia aut vitae quisquam sit nostrum reiciendis molestiae esse et hic ut quibusdam reprehenderit consequatur quasi occaecati sed nesciunt et sint maiores ut dolorum porro tempora eum provident commodi tenetur sit nihil non repudiandae autem eos nesciunt quos qui quisquam explicabo a sit quis doloribus iusto dolores voluptatum rerum dolor architecto voluptates molestias at voluptatem explicabo iste quia expedita ex sapiente odio in repellat qui dolores rerum aut beatae deserunt beatae eos voluptas dolores soluta corrupti omnis eos omnis aut omnis exercitationem perferendis dolor perferendis non velit fuga nam temporibus rerum velit tenetur debitis a quis aut eveniet et minima hic accusamus cum animi aperiam et dolorum provident eaque tenetur explicabo debitis quo distinctio quia distinctio veritatis vel eos ullam ratione aperiam dolor ullam odit quo commodi nemo quibusdam ut nesciunt asperiores asperiores exercitationem perferendis vel molestias quibusdam consectetur dolorum corrupti tempore voluptas libero voluptatem vitae sapiente rerum cum ut perferendis deserunt cupiditate quo ad eos sapiente sed volupta