INSERT INTO `course_news` VALUES ('430', '10', 'Explicabo occaecati laborum enim officiis beatae voluptatem.', 'Doloremque voluptatibus labore quasi repellat quo dolore assumenda quia est sit quo id ratione molestiae culpa et nostrum perferendis est ut quia aut velit sit est dolor nisi unde voluptatibus consequatur nihil similique et porro architecto autem maxime eos et rerum minus consequatur possimus est neque ullam culpa laudantium quos quia quasi quos vel minus voluptatem dolores dignissimos incidunt pariatur praesentium ducimus eos aut eos repellat dolorum provident reiciendis at omnis nam rerum perspiciatis commodi nostrum quo ut aut a temporibus totam est eius numquam ea temporibus et id et ducimus expedita aut odit quas ipsum ut possimus sed et corporis quam ut possimus et expedita incidunt itaque ea iure voluptas et dolor quidem est ut tenetur itaque repellat omnis fuga et exercitationem molestias perspiciatis sed numquam ut magnam tempore vel est sint tempora aut iste sunt saepe tempora qui itaque animi incidunt et pariatur nihil qui nam voluptatem quidem consectetur occaecati quaerat similique asperiores eveniet dicta atque praesentium reprehenderit rerum vel delectus quo maiores deserunt atque vel non est sunt quibusdam voluptatem vel temporibus aliquam consequatur placeat consequatur nobis explicabo unde in blanditiis sit quasi dolorem perferendis et asperiores fugit incidunt rerum quia dolores aut quibusdam ipsa voluptatum consequatur dolores expedita sapiente a eveniet voluptatem animi aut possimus aut ut dolore et id non eos suscipit sed quis libero ea atque voluptatem doloribus et odio maxime saepe asperiores rem sapiente sit asperiores voluptatem blanditiis natus occaecati sint similique voluptatum voluptatem est sapiente sed voluptatibus esse ipsum fuga consequatur consequatur sit iusto molestiae dolorem voluptatem et dolorem consequatur vel facilis quisquam praesentium officiis eum facilis consequuntur cum magni quis ut doloremque excepturi aliquid voluptatum dignissimos repellendus sit eligendi et aperiam ex ex omnis sequi sint esse aspernatur accusamus odio praesentium sunt id nulla est itaque non voluptatem dolorum magnam sit et sit quibusdam sed ipsa perspiciatis et quasi animi tenetur a enim cum.', '0', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('431', '7', 'Ut quidem porro a assumenda quo beatae.', 'Exercitationem incidunt numquam qui velit repudiandae omnis laudantium facilis nihil dignissimos odio quos aut enim ut autem in rerum quaerat voluptatem et architecto harum sunt fuga hic et ab doloribus quaerat suscipit sed ut incidunt ut ut asperiores blanditiis et vero ut omnis ea voluptatum exercitationem in rerum aut qui et maiores ratione in eveniet aut quis ad earum molestiae error quo quia placeat cum dignissimos ut quibusdam molestias et ut ut ad quas et non porro non sunt id ex est reprehenderit quis eos est veritatis deleniti ut sed libero facere nihil est tempore eos sit repudiandae maiores fugit et aut laudantium vel ullam assumenda ut illo commodi nostrum corrupti corrupti accusantium optio aut voluptatem cum nisi facilis explicabo dolores odit nihil sunt sed delectus expedita inventore animi explicabo sunt quia rerum laboriosam quis et laborum laudantium voluptatem ut eaque non et nemo voluptatem in dicta inventore quia quia sit fugit optio sapiente voluptas reiciendis culpa eligendi non voluptatem facilis voluptatem est quia repudiandae aliquid deleniti molestiae quibusdam quam quia eveniet rerum delectus est saepe iusto aut provident non officiis rerum consequatur placeat deleniti quam qui rem consequuntur reprehenderit quidem et odio voluptas laudantium aut cumque enim sed est aut vel quia aut eum voluptatibus similique enim voluptas exercitationem commodi qui aut quo ipsa suscipit perferendis aut debitis officiis vel et aut ut officiis corrupti quis commodi veniam aut atque eveniet quasi rerum necessitatibus aperiam quas maiores commodi hic iste consequatur nemo ducimus sit voluptatem est magnam facere ut ut ut delectus dolor et quia cum voluptas ipsum voluptates animi nostrum et et nostrum consequatur veniam qui culpa ipsa et dignissimos magni alias qui consectetur harum dolorem dolor culpa.', '0', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('432', '6', 'Rem quibusdam sunt et cumque vero laboriosam quia.', 'Voluptatibus nisi esse officiis tempore a omnis assumenda aut unde exercitationem at deserunt nesciunt praesentium quos eum tempore nulla accusamus asperiores unde doloribus qui vel eos facilis quas non qui quidem rerum et vel est labore et at id autem repellat error nemo quasi nihil eum quis officiis et incidunt voluptatem officiis laboriosam voluptatem adipisci ad illum voluptatem ut quis aperiam quia eaque quo vitae id dolor earum porro ut id porro est debitis illum sunt sunt omnis commodi in commodi doloremque laborum consequatur hic repellendus non consectetur consequatur ut quia maiores cumque magnam deserunt distinctio ea iure ad repudiandae sunt amet debitis labore placeat fugiat quos porro officiis rerum rerum modi sit ab voluptate reprehenderit sunt ut et neque quod nulla accusamus ut optio ullam asperiores aut perspiciatis rerum adipisci nulla numquam rem eligendi consequatur maxime aut voluptatem quibusdam asperiores ipsam necessitatibus enim ducimus nesciunt aperiam dolores eveniet reprehenderit fuga fuga repudiandae quia nemo expedita officiis nemo expedita qui repudiandae quo deleniti qui unde minima sunt laborum consequatur assumenda et quis qui laborum veniam veniam facere sed quaerat magni aut voluptas eos corrupti perferendis dolores laborum nobis praesentium dolor optio esse et voluptatem possimus consequatur qui quo quos.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('433', '4', 'Ea ipsam rem est iste.', 'Exercitationem doloribus ratione voluptatum debitis natus excepturi magni totam soluta voluptatum voluptatum quisquam natus aspernatur et est eos provident dicta molestias recusandae odio quos in non enim consectetur quia qui magnam ipsa omnis sapiente ab atque temporibus eveniet dignissimos excepturi quia incidunt non placeat odio optio doloribus aliquam ut odio consequatur quia illo dolorum dolorum nemo ducimus minus et labore tempora rerum consequatur a temporibus odio aliquam nobis qui iusto et fugit illum autem unde alias in suscipit voluptas eveniet minus eos beatae expedita vel molestiae earum eveniet error et aliquid eos perferendis pariatur voluptatibus beatae et consequatur non eveniet et repellendus exercitationem omnis consequuntur quasi odio laudantium sit harum et ducimus praesentium aut ipsam qui nihil minus tempora deleniti officiis eius fugiat rerum earum consequatur eum quos commodi et qui aliquid harum voluptas et excepturi fuga sit numquam nam ipsa nihil minus molestiae qui eos nulla natus voluptatem aut suscipit cupiditate saepe impedit voluptate quasi et repudiandae vel doloribus eos voluptatem unde esse debitis laboriosam dolores id et in porro qui sed repudiandae non molestiae corporis quibusdam provident vero quod non harum autem voluptate quam temporibus dolorem ad ea accusantium blanditiis quasi animi consequatur et sed nemo et porro aliquam similique veniam quos ea laboriosam similique cumque impedit rerum est autem qui aut sint est quae eligendi modi et fugit et et est aut occaecati qui totam modi aliquid esse tenetur quo non voluptatem corrupti aliquam non quasi facilis velit iusto qui quia.', '0', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('434', '1', 'Sed consequatur porro sed aut et rerum.', 'Quae est molestiae necessitatibus ad eos tempora voluptas porro sapiente ut alias dolore doloribus expedita dignissimos praesentium aperiam magni iusto autem animi qui ipsam error optio aut quisquam nisi sit quas doloribus laudantium perferendis dignissimos hic quo iusto corporis beatae qui et aut aperiam qui sint reiciendis sint similique molestiae id ipsam mollitia ex quas dolore quam facere voluptatem ut minus qui nemo quos ex recusandae sint dolores et qui dolores expedita praesentium deserunt id qui autem corrupti quia est unde pariatur eaque et fuga qui sequi maiores ipsa quia voluptatem eius sint dolorem ut quia impedit exercitationem facilis et minima magnam aperiam qui eum aut voluptas qui accusamus autem necessitatibus dicta ea esse quia dolorum eligendi amet iste ullam id voluptas maiores sed quod illum sunt laborum nisi exercitationem sed in repellendus itaque ea voluptatem consequuntur natus cumque adipisci ut inventore nulla odit earum ipsam quis dolores laboriosam recusandae quidem natus ut odit saepe voluptatem totam sit enim animi voluptatem suscipit rerum nulla rerum aperiam aut quisquam rerum quia dignissimos veniam dolores non ratione et et et illo quo ea pariatur aut repellat molestiae nam ut enim est dolorum deleniti rerum impedit voluptates nulla suscipit voluptas doloribus magnam sit odit quis aperiam id eos repellat omnis quod possimus quia perferendis ut est eos placeat dolor hic voluptatem omnis mollitia provident corporis rerum aut suscipit accusamus qui voluptas optio qui tempora adipisci sed vel libero praesentium velit molestias occaecati recusandae nobis eos quidem aspernatur illo enim autem eius animi eveniet molestiae at aut non sunt sed corporis dicta laudantium eligendi sit itaque accusamus autem quia cupiditate suscipit fuga excepturi cupiditate quibusdam voluptates perspiciatis eaque ducimus minima dolores soluta non nihil id mollitia moles