INSERT INTO `course_news` VALUES ('435', '5', 'Amet assumenda libero eaque sapiente vero incidunt.', 'Est quaerat et blanditiis odio rerum odit occaecati earum aspernatur consequuntur voluptatem laboriosam quod voluptate eos excepturi et vero temporibus qui et laborum non illo suscipit ut repellat laboriosam aut culpa excepturi qui eos nostrum quis rerum voluptatum voluptates illo iusto deserunt ducimus culpa voluptatibus ut odit alias molestiae nihil ut occaecati enim laudantium consequatur aliquam aut accusamus aperiam iure ipsum assumenda eum quae repudiandae consectetur voluptatem quaerat assumenda illo eum quos ea quia vero sunt ipsum quasi et quia magnam architecto eos aut rerum autem quis tempore beatae deserunt architecto quis consectetur at est autem aut sint earum eum ea rerum corporis dolorem porro in nesciunt est et ut qui a et corporis et officia vero eum voluptate enim quia eius omnis fugit ipsum et officia tempora quis laboriosam officiis necessitatibus nisi maiores nostrum maiores qui et tempore qui mollitia ad ipsam eius laudantium vitae amet est fugit libero odit doloremque facilis nemo dolorem corporis voluptas odit reprehenderit repellendus occaecati voluptatem consequatur voluptatum a quam quibusdam sed inventore fuga odio atque incidunt illo dolor quae et rem aut cupiditate et aut itaque quidem et fuga debitis iure ipsum velit temporibus voluptatibus pariatur temporibus dolorum reiciendis qui voluptatem tempora nobis in repellat commodi atque rem voluptatem quae sed laudantium asperiores saepe fugiat hic libero error omnis atque omnis quia rerum voluptatem sunt quis omnis doloribus autem at aut quod veritatis quod dignissimos.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('436', '8', 'Neque ea minima voluptatem labore eum.', 'Et et non adipisci repellendus iusto dolorem rerum sit aut doloribus explicabo a natus fugit id omnis soluta ex officia consequatur quia asperiores est id asperiores minima error veritatis possimus ratione et ut nostrum voluptas provident amet nam molestiae soluta quam explicabo fuga vero fugiat non consequatur voluptatibus id quae maiores blanditiis dolor sed maxime deleniti at culpa quas a et eos repellendus deleniti at eius doloremque voluptas deserunt ab repellendus dolorem quia eum vel molestiae beatae nobis quibusdam nulla a consequuntur dicta corrupti qui consequuntur nulla consectetur sed aliquid rerum eos earum enim animi est saepe repellendus ipsa eos neque perferendis perferendis officia sunt est sint delectus voluptas accusantium omnis dolore cum maiores ut beatae quae voluptas dolor molestiae et quia consectetur reprehenderit accusantium eos animi ullam numquam dolorem occaecati explicabo voluptatem culpa officia fugiat enim repudiandae dolorum et id autem sed id sapiente ut reprehenderit minima laborum aut est occaecati beatae mollitia vitae sequi quia libero et iusto omnis eos et quidem neque blanditiis rerum molestias ut non fugit expedita numquam quia officia rerum nihil eum impedit ut asperiores qui velit modi voluptatem quia nostrum et rerum quo asperiores perspiciatis nesciunt est culpa porro minus aut minus id autem est quasi facere sunt sunt asperiores aut sit enim sapiente ex est sint nihil quis quisquam ad rerum unde iste sit nihil ullam vitae est vel in porro est voluptatum excepturi ut aliquam deleniti hic iste quae ipsam illo consectetur placeat fugiat qui aliquam cumque dolores animi adipisci minima sapiente autem et soluta ea consequatur perspiciatis similique ullam molestiae quod est fugiat libero animi ut ab et qui odit voluptatem tenetur consequatur at quia corrupti et dicta quae sequi sit ipsum veritatis exercitationem veniam et consequatur veritatis possimus sit iusto veritatis voluptatum possimus amet tempora et molestiae qui rerum quo sunt laboriosam sapiente ipsum incidunt nihil at doloribus rerum dolores amet soluta.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('437', '5', 'Excepturi vitae nam tenetur et inventore repellendus.', 'Dolorum labore omnis quas voluptas cum fugit ut numquam magni soluta explicabo et optio pariatur aperiam illo enim quos perferendis amet placeat non quisquam molestiae earum pariatur cupiditate aut maxime est odit asperiores consequatur mollitia quidem et qui qui illum veniam voluptas voluptas eius veniam accusantium suscipit eligendi laborum illo totam cumque dolorem qui occaecati eveniet ipsa tempore inventore quo autem eius consequatur placeat perferendis et quibusdam error a reiciendis et quo rerum id nam dolores aliquid quisquam exercitationem unde ipsum blanditiis sit voluptatem veniam error sed rerum illum dolores et dicta sunt in laborum eaque et cupiditate mollitia tempora ut ea iste dolorum aspernatur commodi accusantium sed et dolorem quo maiores dolorem ullam facilis quam consequatur consequuntur minima beatae suscipit earum optio dicta unde culpa illo ullam ducimus sequi corrupti laborum assumenda expedita autem sit aut quidem est non velit rem laborum quo quia optio tenetur dignissimos debitis illum a ut id cum explicabo nulla quas fuga iste omnis voluptas facilis totam enim adipisci tenetur recusandae dolorem et tempore qui occaecati et facilis necessitatibus velit et pariatur cumque dolores adipisci dolore repudiandae assumenda eum ipsum et quia sit dolorem nihil molestias eius illo eum et sit quidem est minima quam corrupti omnis repellat at dolor neque reprehenderit veritatis et minima eligendi neque non enim labore ut suscipit impedit autem quia minus quia quaerat rem neque quibusdam et sequi quia quis ut voluptas velit ut esse qui ut at voluptas incidunt sed et explicabo sint sint ducimus qui inventore quod consequuntur dolor provident omnis non architecto repudiandae aut dicta facilis qui est voluptas qui rerum porro deserunt sit explicabo non illum perferendis minima et est placeat officiis aperiam consequuntur illum laborum doloremque repudiandae laboriosam numquam aut vero dolorum et possimus dolor ab numquam voluptas modi assumenda dolore architecto qui voluptatibus expedita eos quos dicta est quae dolore quo et molestiae est non maiores assumenda soluta animi quia eius quo aliquid numquam occaecati vel doloremque minima et placeat deserunt quis enim minima iusto eveniet dolores amet accusamus nulla earum et tenetur debitis assumenda assumenda aut qui reprehenderit occaecati itaque eos velit aut modi inventore molestias aliquam ducimus ipsa est dolor et quia ut doloribus quia deserunt repudiandae vero tempore illo aut.', '1', '2017-05-02 22:59:09', '2017-05-02 22:59:09');
INSERT INTO `course_news` VALUES ('438', '4', 'Officiis non facere eum vel optio.', 'Amet reprehenderit quo magni quia ut et dolores quia odio qui itaque exercitationem fuga reprehenderit expedita quaerat culpa eos illo voluptates reiciendis ab reprehenderit vel autem ut repellendus consequatur debitis sint neque temporibus et et inventore illum enim harum itaque ex est enim aut officiis totam autem debitis quo praesentium atque omnis incidunt delectus nihil repellat omnis blanditiis in qui provident consequatur et reiciendis voluptates quis expedita labore libero consequatur expedita sunt est quibusdam aut consequatur et mollitia suscipit sapiente dolorem et et consequatur est quo accusamus sequi aut quia qui quibusdam porro cum amet repellendus non excepturi dolores occaecati et quidem fuga nihil et quibusdam est aut eos eligendi neque voluptatem consectetur ut magni aspernatur dolores praesentium rerum et omnis aliquam esse nesciunt rerum et qui fugiat ea vel dolor exercitationem enim praesentium nemo ut aut est porro aut quas praesentium sed impedit quo itaque facilis commodi quas sit ea quia beatae sapiente est rerum soluta dolor sequi aliquam sint et praesentium nesciunt esse modi distinctio totam eos voluptatem similique repellat beatae ad autem illum numquam possimus dicta possimus labore ipsam mollitia molestiae quo harum consequatur ut et nisi est quas eum accusantium sunt itaque aut ipsam ut optio necessitatibus est nihil magnam ipsa blanditiis beatae natus velit odio consequatur et eos omnis sint voluptates ullam labore ea odio vel eos eligendi est eaque ex nostrum blanditiis hic in quasi aut laborum omnis impedit.', '0', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('439', '6', 'Sed laudantium quasi enim exercitationem assumenda minus molestiae.', 'Aut odit velit ut in assumenda omnis natus earum excepturi exercitationem in aliquid sit quos quo non eaque placeat laborum itaque distinctio est sunt delectus id perspiciatis quam hic eveniet qui minima ipsam reiciendis quia tempore omnis aut harum aut quo unde minima nam dolorem voluptas est id error magni mollitia nostrum rerum a rem delectus ab quia est occaecati et autem nulla quis ipsa voluptas tempora ipsum qui animi aspernatur atque quasi tenetur minus non ratione culpa provident magni quisquam ea libero iusto et itaque distinctio et placeat voluptas voluptatibus vitae dolor voluptas minus cumque voluptate error perferendis quas officiis fugit quia cupiditate ea id illo consectetur ipsa dolorem sed eaque fugit animi dolore qui eveniet et repellat iure id optio officiis ipsum qui provident nemo iste consequatur laboriosam debitis sequi maiores alias hic ratione laudantium corporis veniam recusandae quisquam tempora iste quas necessitatibus facere quibusdam consequuntur rerum delectus aut et sunt laudantium veritatis porro aut quo architecto explicabo reiciendis voluptatem animi reprehenderit molestiae sint commodi nesciunt modi et totam voluptatem hic dolorum unde ut ut impedit quo harum dignissimos neque consectetur excepturi amet incidunt sunt rerum qui vel consequuntur ducimus blanditiis est facilis delectus nostrum fugiat nisi est excepturi cupiditate sequi non est aut officiis excepturi debitis quia ea quis rerum excepturi sit neque et ullam architecto amet quibusdam iusto quas qui numquam numquam et pariatur et voluptas temporibus quod placeat nisi quibusdam exercitationem ut vitae velit reprehenderit provident consequatur repellendus ut molestiae nostrum dolore culpa sit itaque est quo eos ullam qui sint ut amet at ab ea molestiae adipisci velit fugit perspiciatis voluptas animi ipsum animi aut labore qui corrupti itaque qui ipsam qui e