INSERT INTO `course_news` VALUES ('440', '3', 'Nihil rem aut aut minus quidem corrupti.', 'Architecto molestiae dolorem non optio molestiae exercitationem omnis nisi iure vel consequuntur et ea mollitia quia eos tenetur accusantium rerum doloribus ad pariatur sit eos voluptas porro veritatis vitae rerum eum totam eaque aperiam est aperiam architecto nemo dolores reprehenderit delectus corrupti sunt sequi nesciunt non repellendus reiciendis optio voluptatem voluptatem enim iure ducimus vitae vitae recusandae similique eveniet nostrum est iure dignissimos delectus sit corrupti natus nam dolor animi ea rerum vitae nihil atque cumque sunt aut aut neque enim in blanditiis molestiae ipsum corporis ab et omnis et corporis voluptatem et fugit nesciunt molestiae aut aut quaerat placeat voluptas in aut libero velit iusto optio cum eligendi harum placeat id consequatur facere illo quos non incidunt nemo provident minima nemo ut eum tempora earum consequatur deserunt dignissimos sapiente magnam culpa porro ratione minus dolorem numquam autem magni sint dolorem ipsum ipsam vero quis natus perspiciatis voluptatem numquam harum et consequatur explicabo voluptate occaecati rerum in et pariatur blanditiis et iusto dolorum quia voluptas laboriosam nulla voluptas iure explicabo sint in minus quasi officia nisi unde est quo minima optio voluptates totam rem explicabo adipisci et repellat neque perferendis necessitatibus minima praesentium reiciendis maiores minima voluptatem possimus blanditiis tempora provident suscipit qui quo sed quam voluptatem voluptates modi soluta unde ea repudiandae est in commodi sint.', '1', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('441', '7', 'Temporibus impedit numquam blanditiis aliquid eos.', 'Doloribus placeat a amet repellendus vero nihil ipsam sapiente voluptates ut nisi voluptate tempora quam quia eius esse voluptatem eaque ipsa necessitatibus vitae blanditiis in natus voluptatem consequuntur voluptatem enim dolore velit dicta et aliquam quis dolorem placeat et soluta dolor error dolor ipsa ut autem eaque ad vel ipsam eos veniam in debitis tempore perspiciatis cupiditate enim totam harum eius soluta labore suscipit sunt vero sint ut aspernatur voluptates exercitationem veritatis nam molestiae sint sapiente sequi quam ut et non accusamus aut id expedita et ipsam autem sit eaque neque labore nemo minus omnis sint ex aspernatur facilis eligendi iusto est et et non dolores perspiciatis dolorum at iusto quia praesentium voluptatibus sint assumenda nihil beatae voluptatum eveniet nisi consequatur recusandae distinctio ut maiores ipsum officia quis aspernatur magni rerum facilis nesciunt quia consequatur atque rerum eligendi dolorem est voluptatem delectus natus quos vel aliquam est dolore quas distinctio cupiditate numquam assumenda eum voluptate harum qui omnis minus qui at delectus qui qui qui neque sunt et reprehenderit a ullam sapiente officiis eaque qui inventore dignissimos aut iure numquam odio tempore nostrum voluptatem quia quae doloribus reiciendis accusantium odio veritatis consequuntur qui nobis alias praesentium laboriosam ratione est odio eum soluta non dignissimos excepturi quia dolores commodi aut nihil ut pariatur molestiae cupiditate sit optio aperiam voluptatibus aut natus deserunt voluptatum eligendi et voluptas voluptas est dolore qui recusandae deserunt porro aperiam repellat quidem laudantium quasi minus in incidunt inventore facilis alias nisi neque laudantium fugiat natus nobis odit velit excepturi qui ut quia nihil ad totam rem cupiditate distinctio sed vel deserunt repellat magnam sunt ea et quo minus omnis in molestiae esse adipis