INSERT INTO `course_news` VALUES ('442', '4', 'Provident excepturi unde perferendis voluptas itaque accusantium soluta.', 'Sed enim rem ut modi minus modi aliquam delectus velit libero commodi iste autem ut tenetur aut adipisci qui aut sequi alias mollitia repellat facere est dicta tempore incidunt vel est perspiciatis totam explicabo ipsam rem est assumenda voluptatem sed possimus quod sed consequatur ullam aspernatur dolorem quibusdam mollitia tenetur quas ipsum et saepe animi exercitationem deserunt ratione architecto repellat nobis molestiae inventore neque error officiis velit quae quia quo qui ipsum qui repellat vero pariatur sed non ex facere facere cumque rerum similique quo aliquam qui impedit est quis ex dicta doloremque dolorum neque sapiente odit eum sint cum sit voluptatem minus sint dolores dolor eius sunt perferendis qui enim quod amet numquam voluptatem qui maxime est qui consectetur nisi qui impedit eum ut ut praesentium et molestiae earum sequi iusto sint autem beatae maxime nisi tempore esse sunt est ad illo ullam iste ut consequuntur praesentium consequuntur quos eum voluptas totam nisi nisi quia et placeat est doloremque autem aut blanditiis libero incidunt qui maiores natus soluta consequatur ea laboriosam aut rerum aliquid minima ut aliquam pariatur quia architecto nisi ad dicta odit repudiandae saepe dolorum sed vel quia et enim vero temporibus nobis dignissimos praesentium adipisci ea vel id vel voluptates enim eaque ut praesentium dignissimos laudantium temporibus quia omnis ipsam deleniti ratione illum fugit consequuntur harum odit et eligendi ea maxime alias ea quasi consectetur facere amet neque vero nostrum et quia et blanditiis perferendis voluptas architecto aspernatur numquam qui voluptatem tempore voluptatem voluptates sint deleniti dolore voluptatem praesentium deleniti ut et facilis iusto perspiciatis modi odit et architecto sunt sed velit dignissimos quis placeat ut blanditiis assumenda perferendis nobis ipsa laudantium dolorum voluptas asperiores a aspernatur libero qui repudiandae quia quia atque quibusdam cupiditate sint quas nobis veritatis aut magni reprehenderit fugiat quia labore corrupti ea culpa ex qui iste unde ab eos ut autem omnis non quos illum est est quidem esse nesciunt aut id expedita voluptate nisi et asperiores est possimus suscipit at quos quibusdam voluptas hic nisi similique consequuntur officiis placeat inventore repellat enim rerum eius ducimus facilis officia qui quo quia sint ullam velit dolores quia ipsum dolor laborum adipisci qui minus maiores sapiente officiis recusandae quidem optio aut quod alias fugit natus quas et voluptatibus reprehenderit corrupti totam voluptas tempore quo omnis mollitia non sit nobis saepe non officiis distinctio quasi consequuntur nobis harum assumenda corporis quo eveniet repudiandae quia necessitatibus natus et aliquam ut tempore voluptatibus reprehenderit ut laborum sapiente unde delectus velit atque laudantium culpa nostrum eum voluptatem esse.', '0', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('443', '9', 'Harum consequuntur delectus sint dicta omnis possimus occaecati.', 'Repudiandae tenetur corporis et consequatur fuga dolorem dolor aut qui id sed voluptate quia velit dolor debitis sit quisquam omnis inventore ullam debitis itaque magni dignissimos ut nostrum culpa quia blanditiis et expedita in sunt officia nostrum ut reprehenderit sint non velit ea et placeat quae praesentium quibusdam maiores ut velit suscipit ea tenetur sunt eos id quam voluptatem amet voluptates deserunt quo sequi est ratione exercitationem tempore aut mollitia quaerat voluptatibus quia dolore est consequatur quo et incidunt necessitatibus laborum neque nihil beatae dolor doloremque odit distinctio fuga perspiciatis debitis facilis dolore unde rerum odit qui repudiandae suscipit praesentium distinctio voluptates qui labore consectetur similique dolor magni voluptatem aut minima dolorem ut rem ad ab exercitationem cupiditate itaque neque qui expedita sit pariatur ullam voluptate repellendus ipsa ut ut aut ab blanditiis et totam neque beatae omnis et quia tenetur et esse cupiditate sit magnam ut sit culpa accusantium esse sit accusantium unde exercitationem mollitia fuga quam omnis inventore ab fuga doloremque laudantium voluptates quam sunt cum illum similique velit culpa nesciunt est necessitatibus totam asperiores velit possimus in dolores et nisi dolores placeat nisi ipsam sed et dolore est et atque saepe eos perspiciatis atque unde quisquam voluptatibus tempora vero reiciendis corrupti sint necessitatibus maiores et nemo deserunt quod ut sed voluptates.', '0', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('444', '4', 'Expedita et natus rem accusamus qui.', 'Doloribus quia eum sit beatae vero non rerum omnis qui labore vero error voluptatem cum omnis dolor quasi in debitis quisquam repellat nihil mollitia quia quia asperiores enim ut unde aliquid labore dolorem rerum velit sunt inventore qui quasi ut atque adipisci qui maxime eius earum perferendis blanditiis incidunt sit qui sed sed repellendus perferendis nobis vero mollitia natus et et dolore minus ipsa quos est voluptate aliquid maxime inventore molestiae quaerat voluptatem aliquam nisi rerum tempore nesciunt ea officia aut laborum qui a qui incidunt quia itaque dolorem nihil voluptatem sint sint molestiae consequuntur impedit reprehenderit reiciendis fugiat nemo aliquid iure at doloremque ea possimus fuga similique rerum minima reiciendis eveniet aut iure sit impedit voluptatibus veniam libero eaque repudiandae possimus repudiandae omnis aut possimus quia rerum quas assumenda incidunt similique quo et iusto repellendus repellat praesentium repudiandae rem eligendi dolor modi nobis reprehenderit et sed non labore impedit ipsum nesciunt aut nisi commodi officiis modi rerum debitis in consectetur perferendis praesentium quibusdam fugit non voluptatum molestiae quo veritatis est quis eum delectus ab debitis atque enim voluptas aspernatur repudiandae quae nihil quos blanditiis consequuntur et omnis hic exercitationem quo dolor qui error at laboriosam natus consectetur eum quidem et vel minima reprehenderit quisquam reprehenderit quia earum illum nostrum vitae ea a fugiat cumque maxime assumenda in soluta eius laboriosam itaque pariatur totam quisquam minus quas aliquid quo sint non nesciunt assumenda atque suscipit aliquid nihil numquam maxime saepe nam facere excepturi doloribus aut quia quibusdam recusandae non culpa praesentium error similique et ut cum sint similique nihil nulla aut voluptas voluptatem praesentium et at et rerum omnis mollitia itaque veniam ipsam magni id error sit omnis est fugiat id quasi iste unde qui soluta et eos commodi sit accusantium quod saepe est sequi error voluptatem doloribus quis dolores est est qui et numquam facilis dolorum temporibus voluptatem et explicabo sequi maxime reiciendis iste sunt officia labore totam ut quis unde ex ab suscipit aut placeat ut corrupti ipsum occaecati eum autem repellat magnam reprehenderit saepe et recusandae possimus quis reiciendis optio ratione ut voluptate maxime esse iusto magni error quia nostrum sed debitis eum quos occaecati iste placeat voluptatem.', '1', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('445', '2', 'Perspiciatis quam dolor illo laudantium in amet modi.', 'Exercitationem perspiciatis inventore ex omnis modi alias nemo sint et sequi repudiandae et dolores fuga qui atque quo possimus saepe omnis enim iste fuga hic ad facilis placeat tenetur aliquid hic occaecati quidem omnis iure ut ut cupiditate veniam corrupti dolorum consequatur harum rem doloribus perspiciatis commodi ullam in qui maxime illum tempore maxime aliquid consequatur quaerat veritatis ut rerum eius iusto sunt explicabo quibusdam libero numquam aliquam maxime sunt dolorum dolor eligendi quaerat dolorum quis voluptatem sit non voluptatem quibusdam et expedita autem ea iure architecto est impedit eveniet est voluptas rerum facere molestiae dolorem placeat minima eligendi quibusdam ut nulla blanditiis quia consectetur autem fugiat ut sit rerum aliquam facere esse vero cum aut quis aut dicta pariatur molestiae accusantium saepe perspiciatis molestias inventore quos aut nisi quaerat quia et qui possimus natus rem quia et nemo exercitationem pariatur velit omnis veniam praesentium odit in et consectetur laudantium sunt quas et recusandae ea aut et aperiam accusantium atque quia neque debitis repudiandae perferendis ut optio ab ut non doloremque rem in sit quia ducimus et eveniet enim cupiditate ab.', '0', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('446', '3', 'Qui quia in repudiandae ducimus.', 'Occaecati repudiandae ducimus voluptates quo provident deserunt dolorum id dolorem sit ut ullam pariatur aperiam modi iste laborum et at officia expedita provident in omnis harum accusantium dolores sit nisi architecto consequuntur distinctio laborum omnis aut dolores et eos porro et voluptatem harum eius omnis ratione ab dolore voluptas et praesentium optio enim animi repudiandae nisi quos atque illo voluptatem assumenda eius ipsum nostrum dolor modi doloremque facilis praesentium dolor quas minima itaque debitis ducimus voluptatem voluptatibus natus quia saepe nihil sint consectetur odio odio odit repudiandae totam ut rem qui ullam exercitationem voluptates quod iste vel explicabo harum quidem dolor omnis at doloremque esse voluptas ut sunt eum aut saepe omnis incidunt nobis sed illo voluptates quos hic veritatis itaque quae dolorum perferendis pariatur nobis accusamus nobis dolor commodi perspiciatis consequatur amet ad pariatur non rerum repellendus voluptate vel nobis tenetur dignissimos voluptates eos eaque incidunt architecto minus pariatur incidunt sunt ex dolor ut labore neque vitae at maxime ea odio earum et dolor totam ipsum sint aut quidem possimus ut cumque necessitatibus dicta quos illum unde ut perferendis minus fugit quae earum ipsam a facere est placeat aut ut ipsam cum nihil ab similique rem recusandae ut nihil voluptas voluptate dolor nihil itaque a nihil perspiciatis explicabo repudiandae dignissimos id et occaecati adipisci inventore cupiditate doloremque numquam aut voluptatibus aperiam exercitationem blanditiis temporibus culpa ut aut autem illo quisquam optio doloribus unde consectetur odit nisi omnis.', '1', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('447', '1', 'Explicabo voluptatem temporibus dolorum vel iusto aperiam sed sit.', 'Unde ipsa rerum dolor sit sunt est vel maiores eos asperiores deleniti sed sit voluptatem voluptas ipsum fuga aperiam suscipit sit repellendus placeat similique et et id adipisci placeat aliquid mollitia facere labore voluptatum ut necessitatibus et esse quo assumenda aut iure aut recusandae quis culpa praesentium eos id ea accusamus perspiciatis voluptatum cupiditate et nulla atque qui iste molestiae incidunt accusamus est ex alias eos consequatur incidunt molestias nulla commodi qui molestiae facere rerum doloribus adipisci ab omnis aliquam quasi rerum et sit delectus totam quia excepturi in explicabo debitis nihil non dolorum reprehenderit nisi labore harum ut dolor fuga libero adipisci numquam aut amet magni vel voluptatem aut magni provident iste ipsum mollitia veniam id praesentium cupiditate exercitationem veniam quis officiis qui doloremque similique inventore quia error molestiae minus laborum cumque et quisquam molestiae excepturi harum dolorum consequatur dignissimos est ab et suscipit quibusdam eveniet laudantium omnis molestiae sed ea aliquam ullam omnis ut nostrum est officia et unde animi molestiae sequi libero dolores maiores occaecati ut occaecati quod quam nulla natus nisi minus officiis ea dolorum qui aut ut ipsam adipisci blanditiis ab est sapiente ut porro saepe reprehenderit inventore cupiditate sunt deleniti aperiam quod atque enim dicta incidunt ipsa ipsum unde illum eos quas rerum exercitationem sit nisi consectetur quae rerum vel labore maiores ipsam dolorum provident sed ullam commodi animi voluptatem est aspernatur commodi consequatur omnis eaque officiis velit cum consectetur mollitia dicta aperiam voluptate eum tenetur dolorem repellat quam alias non ea error rerum quibusdam distinctio voluptas qui cupiditate rerum recusandae accusantium enim doloribus in aut harum quasi fugiat perspiciatis mollitia voluptatem rerum optio