INSERT INTO `course_news` VALUES ('448', '5', 'Omnis deserunt molestiae perferendis.', 'Molestiae illum est ex rerum ad voluptates rerum ut dolores vel quos fuga aliquam vitae aut nihil exercitationem officiis voluptatum rerum earum aliquid molestiae et debitis voluptate quam vel fugiat animi ratione nesciunt delectus dolorem vel vitae sit ab velit voluptate fugiat enim non possimus possimus sit laudantium ad iusto harum iusto et eius adipisci est earum provident perferendis itaque illo veniam voluptatem id expedita nulla modi iure excepturi totam ipsum repellendus sed voluptatem similique hic aperiam eum beatae cum et aut alias ut in tempora incidunt temporibus et aut est voluptate sed iste vitae incidunt aut iusto quaerat atque voluptas molestias suscipit dignissimos officiis omnis consequatur officiis esse ipsum sunt laboriosam tenetur magni qui similique quia ad quia sit ducimus vel eos eaque minus laborum expedita autem ratione suscipit ipsam hic aut excepturi qui odit rem qui aliquid ipsum ex quo porro fugiat facere explicabo rem architecto dolorum et nihil libero deserunt voluptatem rerum hic reiciendis omnis reiciendis molestiae unde commodi aut voluptatibus ut cumque sit sequi nostrum sint cum quia harum consectetur similique dolorem rerum amet error laudantium architecto molestiae qui quia aliquid mollitia libero nulla voluptatem laudantium nostrum iusto quis earum voluptatem vitae soluta numquam est voluptas quaerat eum odio nemo quo temporibus aut iusto sit autem dolorem ut exercitationem dolor consequatur id sit ut eos consequuntur exercitationem magni quia nobis modi nostrum magnam expedita similique ut quibusdam corrupti hic pariatur vel et sed pariatur quia ut natus quia nobis repellendus est pariatur ab ipsa itaque est commodi consectetur sed laborum consequatur et sunt est est quisquam non qui.', '1', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('449', '10', 'Error rerum eaque dolores eveniet.', 'Vel molestiae non aut quia repellat distinctio ut ut esse accusamus totam nostrum ratione iste perferendis tempore nihil in sint qui id dolores et quo voluptatem maiores distinctio ut aut voluptatem veniam quidem saepe in minima est consectetur et at dolore rerum quod voluptas facere quisquam explicabo ipsa debitis consectetur rerum et nobis tempore at ea nihil id aut eos eos omnis in consequuntur vero rerum quos laborum qui quas nemo odit omnis possimus adipisci necessitatibus soluta molestias laudantium neque aliquid perspiciatis nam saepe asperiores cumque veniam qui consequatur est corrupti repellendus ipsam cupiditate officia quo dolores repellat provident non ut porro fuga optio qui quia aut dolorum veniam maxime ut eum nihil vel maxime fugiat laborum ut expedita sunt corporis sunt vel error nihil iure rem ut qui numquam quae sequi et ea non quod velit non et eos quia facilis consequatur doloribus omnis enim minus ut molestias aspernatur est sed earum error est ut qui cupiditate ipsam ullam consectetur adipisci sed pariatur omnis maiores aut accusamus repellendus officiis molestiae dolores est quaerat et similique tempore sit neque dolorum consequuntur sint voluptate molestias sed quo cum aut exercitationem perspiciatis omnis ut sint voluptatem necessitatibus ullam nisi enim corrupti similique similique suscipit porro dolores esse voluptatibus recusandae laboriosam beatae dolores non magnam esse adipisci dicta qui molestiae animi illo eos consequatur et minima porro id doloremque fugiat tenetur aut rerum odio laborum explicabo iusto aspernatur veniam consectetur dolore veritatis dolorum eos est laudantium modi corrupti magni aut ad quae ipsam et et quo eum voluptatem dolorem et reiciendis assumenda perferendis voluptas dolor distinctio dicta architecto nihil commodi deserunt et vel labore ut quia earum doloremque et nihil qui nisi et amet non et quia reiciendis rerum tempora 