INSERT INTO `course_news` VALUES ('450', '7', 'Id ipsa omnis adipisci doloribus est beatae.', 'Rerum neque voluptatem aut et ab dolorum ut adipisci qui id molestiae illo id perferendis et voluptatem aut natus dolorem optio adipisci eos vel amet qui vitae voluptates voluptatibus beatae est libero est nobis placeat maxime vero dolorum sunt ipsum voluptatem ut odio aut praesentium omnis doloremque voluptatibus animi labore placeat omnis iure impedit voluptate nihil omnis provident quia sunt id quo suscipit et explicabo placeat quasi dolorem beatae ut consequuntur officia ut vitae alias necessitatibus nostrum dolor voluptatem quidem at molestiae cupiditate impedit quasi voluptatem nobis officiis et officia aliquid sit maiores similique sunt ut eos illo assumenda vero itaque et tempora adipisci totam voluptatem sapiente perferendis alias libero ex eius veniam velit doloribus labore architecto ipsam tenetur velit officiis sed sapiente labore ut nostrum adipisci odit quis consequatur est sit fugiat sed cupiditate qui minima vero maiores est sed necessitatibus rerum ut veniam facilis eveniet nobis error est cupiditate pariatur sit deleniti quis occaecati cumque ut perferendis et in qui suscipit eius velit sit corporis velit exercitationem praesentium dolor occaecati unde facere perferendis fuga reprehenderit eligendi eos est debitis voluptatem excepturi eaque aut suscipit quam quidem nobis fugiat rem adipisci repellat dolorum vel dignissimos aut modi quaerat harum a aliquid iure blanditiis quos repellat fugiat possimus sequi eum dolorem asperiores quis ex voluptas alias est voluptatem et fuga est illum voluptas aut voluptatibus repudiandae et ipsum consequatur consectetur nulla minus nisi expedita voluptatem sunt dolorem facilis.', '1', '2017-05-02 22:59:10', '2017-05-02 22:59:10');
INSERT INTO `course_news` VALUES ('451', '2', 'Enim perferendis delectus ipsa.', 'Id unde dolorem ut voluptatibus beatae eum voluptatem commodi dolor nulla fugit magni minima ipsam vel eius sed dolores animi perspiciatis ut qui suscipit in qui velit et suscipit et totam consectetur repellat ut officia qui recusandae illum non sit eligendi quisquam eveniet itaque dolor ipsam odit deleniti consequatur rerum dignissimos et et pariatur id rerum non ut nulla est molestias omnis deserunt tempora at accusantium iure cumque fugiat error dignissimos minima voluptatibus amet ullam voluptatem autem molestias non praesentium odio aliquam dolor in sit hic in dignissimos sed omnis dignissimos nemo porro maxime adipisci et quia cum odit voluptas unde sed impedit aut nostrum fugiat quam voluptatem reprehenderit soluta et ipsa quo totam est sit nam ut tempora quo tempora quam doloribus dignissimos quaerat aliquid magnam nisi aut ut consectetur sint doloremque minima optio voluptate tempora corrupti molestias iste nesciunt sed sit ipsam qui omnis iste in omnis ut asperiores qui perspiciatis iste in sapiente voluptatem earum sequi quis architecto mollitia velit magni nihil aspernatur dolorem qui cumque aut porro qui dolor iure distinctio ut veniam velit animi et quia quia in voluptate molestias quisquam voluptas vel accusamus velit quisquam deleniti delectus ut quam vero fugit aut asperiores aut veritatis illo eius enim cum sequi quos tenetur ea itaque incidunt voluptas aut quos et eius corporis vero beatae totam et maxime saepe corrupti magnam dolores ipsum eius velit et aspernatur a quia nesciunt excepturi voluptatibus corrupti et nesciunt eveniet architecto et aut quasi eum magni vitae aliquid minus inventore cumque quam ea earum quaerat mollitia eos deserunt odit quod sapiente expedita suscipit non ullam veritatis et quisquam omnis exercitationem labore omnis porro eum non consequatur quod voluptatem occaecati earum optio placeat repellendus ducimus atque beatae est qui aliquid et