INSERT INTO `course_news` VALUES ('452', '6', 'Praesentium non suscipit repellendus corporis soluta.', 'Consectetur perferendis dolorum aliquid reprehenderit non in a exercitationem aliquid praesentium voluptatem autem id repellendus ut optio nihil rerum architecto doloribus ducimus molestiae praesentium dolor pariatur sunt blanditiis quod consequatur recusandae expedita expedita aut nulla voluptatem ut non minus sequi veniam deserunt totam facilis illo cupiditate nemo fuga inventore repudiandae enim accusamus et ducimus sit quod accusamus temporibus illo quas consectetur quam rerum nulla dolorum provident consequatur distinctio veritatis similique nulla commodi id et est alias sit eius id voluptate tempora consequatur dignissimos consequatur reiciendis cumque possimus aspernatur deleniti odio sit dolorem at saepe nisi esse quisquam ab dolorem vel placeat rerum maiores sit pariatur sed quia veritatis ut voluptas laborum nam nulla nemo expedita quia minus sed magnam ullam fugit alias rerum dicta omnis aliquam veniam omnis eveniet et eos sit quod esse modi est ullam sit quia ut id adipisci possimus maiores vitae officia suscipit voluptates facilis fuga fugiat aut non quod mollitia architecto fugit similique perferendis voluptatem et magnam ipsum voluptatem eos omnis eius neque eum quae velit dolorem laudantium quae amet atque ab aut at beatae fugit voluptas totam quia odio maiores rerum soluta et occaecati nihil quia eaque nisi modi autem hic nisi illum est pariatur explicabo quas vitae dolorem quo fugiat sed est quibusdam vel quia at ut quibusdam omnis id vel ipsam cum inventore officia officiis ut harum dolorum id vel voluptate sunt nesciunt aut incidunt architecto fuga similique modi occaecati itaque nemo atque eos non odio nobis dignissimos eveniet totam molestias pariatur inventore fuga laborum quia error harum est ut nemo aut dolore deleniti hic omnis non inventore saepe quibusdam illo veniam quia consequatur nihil facilis tempora quae est deleniti sit esse numq