INSERT INTO `course_news` VALUES ('454', '8', 'Unde quaerat assumenda architecto dolor maxime odio dolor.', 'Voluptas deleniti aut ut repellendus qui quos quaerat assumenda quaerat eius et earum itaque consequuntur et provident explicabo et quam delectus provident commodi at aut a et sint doloremque qui sed animi laudantium fugiat sunt ut provident voluptas ratione numquam et distinctio et itaque et doloribus magnam enim ipsum ut explicabo voluptas saepe odio ut beatae delectus esse voluptas omnis exercitationem omnis ipsam provident suscipit qui iste ullam numquam non quasi placeat et debitis quo sit ipsam officiis assumenda ipsam eius molestias rerum enim asperiores fuga asperiores est nobis ab ut ut dolorem ad numquam delectus sunt ad quis sunt sed enim odio a est autem vitae placeat qui voluptatem quis in porro error possimus totam quia quam pariatur quaerat ratione nihil optio consequatur doloribus rerum sint non iure voluptas cumque maxime consequatur alias iste a nisi ullam incidunt et sed qui ut hic dolores voluptas ipsam tempore delectus officiis ut cupiditate neque facere facilis voluptate maxime dolor quo tempora totam ut porro ut sit autem aut voluptas distinctio libero delectus facere consequatur quia nulla alias recusandae deserunt eligendi facere tenetur rerum voluptas culpa consequatur quaerat sit praesentium commodi enim aut velit reiciendis molestias placeat laboriosam corrupti natus non alias officiis architecto quis blanditiis necessitatibus aut tempore facilis quos tempore aliquid minima tempore beatae quas error quis laudantium ut earum sequi ea qui ab eius culpa doloribus sit est sint repellat laborum hic aut unde aut totam eos voluptatem unde occaecati aperiam rerum quia ipsa aspernatur eum est qui nam voluptatem ea nemo est officiis quis aperiam itaque et qui et earum ratione deserunt rerum nostrum maxime consequatur voluptatibus totam ut in molestiae aliquid labore aliquam aspernatur eaque et ex doloribus natus illum quaerat numquam et aute