INSERT INTO `course_news` VALUES ('455', '8', 'Aliquid porro molestiae voluptatem in enim.', 'Nihil suscipit id inventore doloribus est adipisci alias voluptate temporibus optio sed ut nisi vitae et quasi praesentium et dolorum molestiae ab animi est in ipsum ducimus saepe sit temporibus ut fugiat impedit mollitia ut in repellat dolores quisquam mollitia quisquam aut ea tempore debitis corrupti velit aperiam non veritatis aliquid ipsum vel quisquam dolores sed quia natus labore vel voluptas maiores quia est nisi accusantium asperiores et aut repellat assumenda nihil ipsum cumque voluptas hic consequuntur rerum alias ipsum voluptatem id quas impedit ea quam in distinctio possimus assumenda unde ullam dolorem atque dolor quis dolor dolor id at corrupti vel velit voluptatem aut quod et sed autem quasi et reprehenderit voluptatum expedita corporis vel suscipit qui quos fuga possimus voluptate tempore et doloremque ratione vel error rerum architecto dolorum et incidunt et voluptatem minima et atque sunt est autem illum reiciendis animi quod reprehenderit totam numquam iste est fugiat repellendus eos odit explicabo quos consequatur ducimus necessitatibus et sed et distinctio et sit fugit hic sed eum officiis voluptatem odit maiores voluptas impedit fugiat quae consequatur modi eum tempora adipisci consequatur omnis eum accusamus in consequuntur doloremque tenetur voluptatem vitae et fuga quia ut quia voluptas cupiditate ut temporibus doloribus voluptate molestiae quia est ut natus nobis perferendis repellat perspiciatis animi deleniti eligendi inventore adipisci et eligendi facere dolor et rerum libero est unde omnis repellat sint laborum quo dolorum maiores quia et veniam repudiandae est tempora consequatur aut et excepturi magnam quasi eos odio non id animi repudiandae sint saepe qui odio omnis neque expedita commodi nihil magni error est rerum molestiae id rem consequatur beatae qui nihil totam maxime doloribus inventore similique libero rem assumenda et et magni facer