INSERT INTO `course_news` VALUES ('458', '9', 'Et itaque sit reiciendis esse.', 'Possimus voluptas earum totam consequatur molestias itaque et natus quidem autem id doloremque quia minima accusamus laborum delectus consequatur id voluptas optio quia consequatur enim tempora rerum sunt est est excepturi similique mollitia enim nulla molestias commodi ipsa sed ipsum earum doloremque voluptas ad animi dolores expedita voluptas dicta dolor illum veniam aut eum incidunt velit sequi corrupti enim omnis ducimus beatae eveniet qui repudiandae maxime facere distinctio atque ut eligendi eveniet eos ut ut unde quia illo inventore deserunt repudiandae et suscipit culpa perferendis eos ut officia ipsa aut aut soluta laudantium et vel ut deserunt quam aperiam exercitationem minima quidem a molestiae consequatur sequi culpa quas nam consequatur et consequuntur nemo tenetur aut cum esse fuga similique eos consequuntur omnis voluptatem sunt officiis eum quod accusamus placeat esse ut eos pariatur est sit eveniet veritatis expedita id perspiciatis aut reprehenderit nam cum aut necessitatibus qui dolores iste reprehenderit eaque iusto magni excepturi quia omnis repellendus ut error molestiae dolores eos alias tenetur molestiae tempore et debitis doloribus ullam alias blanditiis consequatur fugiat pariatur labore at qui accusantium aut doloribus sequi aliquid veritatis nisi ex non reprehenderit dolor qui ut est veniam suscipit sed perspiciatis et qui ut quia accusantium incidunt atque ut voluptatem reprehenderit exercitationem voluptate minima dicta ad eligendi et aut et maxime aut pariatur ut nulla sed qui et nisi animi a consequatur in possimus hic quia illo laboriosam molestiae quia sunt dolorem et excepturi numquam qui similique deleniti eos praesentium accusantium voluptatem aut dolores qui commodi ut dolores a iure dicta error dolor expedita commodi adipisci dolorem et natus et aperiam asperiores id et possimus molestiae quasi soluta minus omnis sunt et enim maxime omnis sapiente