INSERT INTO `course_news` VALUES ('459', '9', 'Sint perspiciatis magni officiis voluptas.', 'Quibusdam tenetur consequuntur adipisci necessitatibus dicta sint id ex eos veritatis nisi saepe sequi commodi nihil modi ipsam sed est quis quam consequuntur cum aut porro similique accusantium sit impedit voluptatem qui maiores quis quas aliquid quisquam cum culpa autem qui itaque tempora voluptatem esse et et nisi consequatur et repellat minima laudantium sint harum eius aut nostrum possimus qui mollitia beatae et voluptatem voluptatem error quo veritatis harum voluptatem voluptate non sint sed sint optio aut et facere eaque illo eveniet id mollitia voluptatum delectus vel consectetur quisquam expedita qui voluptatem necessitatibus nihil porro illum eos reiciendis qui alias adipisci aspernatur sunt at quasi aperiam consequatur sunt distinctio distinctio debitis cupiditate minima id ad et praesentium aliquam tenetur est cum vero quos sapiente praesentium omnis quia nesciunt consequuntur sed aperiam maiores tempora quidem fugit maiores ut sunt magnam aut earum perspiciatis accusantium aliquid tenetur aut eos saepe architecto quo odio commodi ab vel laudantium deserunt ut rerum reiciendis voluptatem consectetur veritatis voluptates dolorem veritatis commodi omnis corporis doloremque provident cupiditate ut maxime laudantium ut voluptas vel facilis et nihil omnis harum voluptatem sint odit perferendis et animi itaque esse enim maiores quos et eos molestiae dignissimos quia repellat nihil aut repellat unde repellat doloremque excepturi mollitia qui iusto et rerum ipsam expedita quia dolore veniam ut quas cumque vero eos vel ut similique eius et et voluptatem pariatur possimus atque impedit officiis fugiat ut et inventore alias ea et qui velit voluptatem optio sit maiores minima eius ipsam veritatis at ducimus ea qui quasi velit quidem hic corrupti dolorem voluptatum atque consequatur quidem minus cum eum sit architecto repudiandae exercitationem et sunt quod sed corrupti molli