INSERT INTO `course_news` VALUES ('460', '1', 'Eaque atque aspernatur et sit consequuntur rerum repellendus.', 'Explicabo consequatur excepturi autem optio alias rerum hic vel quia ducimus tempora ea autem sed aut optio labore placeat architecto praesentium quam optio sit voluptatem ea maiores eos suscipit itaque aut quasi omnis praesentium deserunt inventore quos velit tempore doloribus autem et sed nobis cum minima impedit fugit qui aliquam tempora eius odio blanditiis sunt sit id sed fugiat sed beatae sapiente laboriosam et et nam aspernatur doloremque occaecati expedita rerum nostrum enim autem natus quia architecto recusandae eius et iusto ad ab aliquam dolor dicta exercitationem voluptates et recusandae qui magni placeat accusamus voluptas quia atque voluptatibus porro eos ratione dolorem esse aut blanditiis corrupti voluptates minima excepturi beatae voluptatem qui earum consequatur quas officia voluptatem modi vel laudantium et voluptatem sit ratione sunt excepturi labore itaque dolorem itaque sequi quisquam qui qui illo ut officia nihil praesentium asperiores numquam expedita dolore maiores sed iste perferendis et provident voluptas dolores quasi tempora sequi aliquid aut est aut placeat dolorem sapiente perspiciatis accusamus iusto at hic qui magni nihil tempore maxime cumque enim quae et nam eos corrupti inventore architecto aut placeat sint nisi qui quas odit sed fugiat nostrum rerum exercitationem quis et nesciunt necessitatibus impedit excepturi modi expedita nulla ab omnis sed minima harum mollitia recusandae eaque sit qui quia ullam est expedita eaque occaecati qui exercitationem dignissimos perferendis quibusdam distinctio qui praesentium et qui dolorem a modi libero et veritatis omnis magni omnis unde voluptas optio est et debitis vel voluptas incidunt omnis vero vel odit dolorem labore fuga non aut inventore distinctio vel culpa dignissimos et consequuntur corrupti reiciendis assumenda mollitia sed eos dolorem doloremque et explicabo rerum omnis n