INSERT INTO `course_news` VALUES ('461', '10', 'Nostrum odio sunt voluptatem est itaque.', 'Vitae nihil facilis eos ad cum quia velit sed explicabo quo ab libero officiis quia velit dolorem deleniti dignissimos debitis fugit saepe a aliquam porro quis incidunt porro ducimus quia eius sed illum labore officia minima sed qui ipsa ut et reprehenderit illo nulla numquam ut dolorem vero nihil id enim veritatis pariatur possimus occaecati molestiae reiciendis vero vel cumque molestias rerum reiciendis sapiente soluta maiores aut eaque voluptatem voluptates ipsam illum eveniet nulla qui voluptatem odit est omnis veritatis porro consectetur nemo autem dolorem nobis quas numquam ipsa dolor at mollitia iusto sint delectus iure vero fugiat est et eveniet nihil possimus nostrum numquam aut odio cum aut quo quos quod omnis et velit ad cupiditate aliquid maxime illum dolorem nemo non et animi quis illo architecto et libero qui veritatis nulla dolorem reiciendis libero deleniti sunt quidem asperiores ut et minus harum sint laborum quis voluptatem occaecati quia perferendis sint impedit officia modi omnis id quia laudantium et iste tenetur sequi reprehenderit a ad at debitis nihil est nam natus id adipisci omnis qui nesciunt nam dignissimos non nisi aut autem aperiam.', '0', '2017-05-02 22:59:11', '2017-05-02 22:59:11');
INSERT INTO `course_news` VALUES ('462', '7', 'Maxime voluptatum odio facilis ut rerum debitis.', 'Et voluptatum quis dolor accusamus omnis sed qui qui sit dicta expedita velit ea et alias quasi saepe similique impedit minus ipsa dolorem quas quidem ipsum ad repellendus in quaerat et laudantium sit aspernatur sit est magni reiciendis necessitatibus repellat qui cumque sequi iusto ut sed enim quidem cupiditate voluptatem aut cumque culpa quis occaecati aperiam illo maxime qui voluptatibus id occaecati maxime qui rerum quisquam sapiente ea consectetur aut illo non voluptatem aliquid beatae est odit ut rerum enim et reiciendis distinctio voluptatem consequatur consequatur cupiditate magni quod necessitatibus distinctio sunt quae itaque debitis aut molestias laudantium quidem optio non consectetur est voluptate accusantium rerum molestiae molestiae culpa dignissimos autem rerum quo vel molestiae corporis dolor magnam nisi qui eos fugiat quibusdam sit assumenda in qui reiciendis eos voluptatum numquam deserunt sit omnis vero earum assumenda suscipit possimus est tempora quia perferendis quis nisi tempora voluptas dolores et libero et aliquam laudantium in ea incidunt aliquid impedit sed dolorem quibusdam velit inventore error aut consequatur qui molestias quos qui praesentium voluptas animi debitis voluptatem et ut qui odio aspernatur modi dolorem minima placeat impedit molestiae voluptas fuga reiciendis blanditiis perferendis excepturi assumenda voluptatem nesciunt voluptas non est aut dolore voluptate eligendi quia nobis omnis omnis expedita adipisci ut doloribus sunt quia voluptas et asperiores voluptatem est dolore ut commodi occaecati qui harum sint aut magnam ea optio autem occaecati sed autem veniam voluptate aut minus aut voluptates commodi illum doloribus quo mollitia quia sequi similique accusamus eius qui libero odio expedita consequatur magnam sit maiores a accusantium dolorem quaerat nam aut a modi et deleniti ex rerum.', '1', '2017-05-02 22:59:11', '2017-05