INSERT INTO `course_news` VALUES ('463', '5', 'Necessitatibus aut eveniet quos.', 'Laborum voluptate molestias voluptatem placeat qui soluta aut maiores sed aut eaque est cupiditate consequatur dolorem ipsum repellendus labore vitae inventore ipsum numquam architecto perspiciatis perferendis dolorum unde dignissimos corporis fugit excepturi asperiores similique error voluptatem officia molestias nostrum esse ut neque tempore beatae aperiam suscipit quia nam aliquam voluptas labore aut repellendus est id ut sint earum cumque dicta iste aperiam nam vero laboriosam et incidunt expedita omnis consequatur corporis sit praesentium explicabo inventore eius ea sed sit et ut et harum eos et tenetur earum officiis odio sit modi unde harum non sit dolores maiores aut possimus reprehenderit rem fugit cupiditate fugit rerum rerum quis quidem quisquam et impedit accusamus officia rem ut rerum deserunt consequuntur dolorum nostrum facere qui cupiditate perferendis quo enim sint eos qui maiores repudiandae temporibus cum vitae et numquam et ab aut modi minima distinctio eos vel aut enim fugit veritatis ipsum dolores iusto eos facere provident odio nulla eos deleniti et esse ut velit vel nostrum fuga non molestias quia deleniti sed omnis quas veritatis reiciendis facere in qui soluta voluptatem itaque porro explicabo quis distinctio ducimus ea deleniti optio nisi error omnis ad et culpa voluptas suscipit incidunt qui harum perferendis labore rerum in id aspernatur vel at perspiciatis qui tenetur explicabo labore praesentium qui molestiae ea illo unde qui iste officia hic illum alias laborum sit deleniti accusamus velit dolorem reprehenderit asperiores ut sed iste voluptatem nobis sunt.', '1', '2017-05-02 22:59:11', '2017-05-02 22:59:11');
INSERT INTO `course_news` VALUES ('464', '8', 'Aut error aspernatur aut et molestiae voluptatum.', 'Laudantium impedit ex quas occaecati molestiae sit hic ad consequatur suscipit at ratione atque ipsam asperiores enim facilis et voluptas exercitationem qui quia in est recusandae soluta et fugit et placeat est qui itaque magnam eos et rerum est alias omnis cum enim et non quod et incidunt aliquid suscipit voluptatem eaque voluptatem sapiente ipsa placeat consequuntur neque temporibus eos aliquid quis praesentium similique officiis soluta est earum provident expedita mollitia nisi inventore accusamus et nobis tempore ut officia accusamus qui cupiditate sit quibusdam consectetur veritatis magni ut sapiente repudiandae totam optio dolorem nihil ratione ullam quibusdam sed consequatur sequi qui temporibus quo nemo enim numquam alias alias occaecati non eum facilis quae et occaecati quam dicta qui quo necessitatibus reprehenderit vero nam est ex id qui fuga nobis possimus omnis aut quod veritatis possimus dolor et occaecati ad non vel quo perspiciatis deleniti nostrum cumque officiis id enim in culpa ut et sed sit blanditiis qui velit sapiente voluptatem odio qui fuga quidem aut distinctio omnis nam adipisci veritatis ipsa ex sunt eum qui in qui omnis repellendus qui similique laboriosam omnis a.', '1', '2017-05-02 22:59:11', '2017-05-02 22:59:11');
INSERT INTO `course_news` VALUES ('465', '3', 'Natus distinctio et corporis qui repudiandae ab qui.', 'Et molestias et labore nihil similique perspiciatis praesentium accusantium adipisci quia iusto repudiandae doloribus est exercitationem et est rerum omnis qui et vel laboriosam quod aut ipsum quidem et non nam quo exercitationem ea labore quibusdam amet itaque nemo quia debitis perspiciatis ad laudantium et totam quidem incidunt voluptas sed ullam dolore est quis debitis at voluptatibus vitae delectus officiis quos consequuntur soluta placeat beatae qui molestiae amet fugiat ut sed repellat sed quibusdam vel at possimus ex et tempore voluptatibus quaerat laboriosam architecto enim nesciunt consequatur temporibus et totam in sit ipsum aliquam fugiat nulla enim aut molestiae magnam fuga enim ipsa explicabo culpa ullam nulla non quos porro delectus in nihil illum explicabo quia quia neque maxime expedita corporis mollitia sed saepe odit perferendis dicta ut deserunt officiis totam nobis fugiat veritatis tempora delectus temporibus maiores non id repudiandae non vitae velit vitae atque quia et magnam nam et modi vitae non sint sed veritatis temporibus dolores molestiae ut ratione aliquam ut saepe sit corporis quam quia facere debitis fugit et a facere perferendis quis illo consequatur quibusdam qui non et et quam deleniti iste impedit qui fuga corrupti est provident voluptatem dolorum minima at et quam sed dignissimos facilis veritatis est asperiores quis ut blanditiis dolor ut ipsam debitis et provident autem atque iure quos ut expedita voluptatibus dignissimos qui soluta molestiae omnis ut natus saepe ab deleniti delectus mollitia maiores quos et vel quas repudiandae rerum nobis quo optio unde qui ut unde cum veniam debitis eum quaerat et voluptas illo et dolores ipsa blanditiis consectetur dolorum dolorem qui amet fugiat et sunt quia ullam nemo cupiditate consequatur mollitia ipsa at aut ipsam quis architecto aut debitis quasi explicabo quo aut doloremque beatae co