INSERT INTO `course_news` VALUES ('466', '6', 'Est velit molestiae iure.', 'Itaque modi deleniti consequuntur voluptas aut soluta omnis veniam fugiat asperiores voluptatem ipsum nihil a qui dolor nam sint sed ad et debitis sit quas iste eaque aut ullam omnis aut eum omnis impedit eveniet doloribus fugiat iure provident ut quia molestiae non quos laborum asperiores et consequatur facilis est recusandae qui pariatur consequatur pariatur a occaecati non aperiam dolor voluptate vero nostrum ut commodi provident sit fugiat doloremque cum laudantium sit asperiores explicabo assumenda quo sit dicta odio quos velit corrupti eligendi ea nostrum voluptas optio odio ut fugiat ut beatae quam quis ipsum sed non dolorem repellat quia exercitationem deserunt id beatae labore ab aut qui sit dolorum excepturi vel perferendis eaque est natus perspiciatis omnis culpa architecto occaecati ut necessitatibus assumenda tempora explicabo voluptas saepe voluptas corrupti ipsum quo ea magnam dolore ad aspernatur porro neque ad dolore facere eum officiis dolorum sit voluptas alias eaque maiores nisi blanditiis quia in illo officia sit cum et et repellat dolores aliquam provident illo et impedit voluptas ex facilis consequatur earum dolorum dolorem dolore eos ullam expedita dolores quas eligendi aut sit dolorem laboriosam sapiente magnam aut corrupti nemo labore dignissimos rerum corrupti aut est nostrum consequatur praesentium mollitia voluptas ea minima occaecati culpa illum quas et exercitationem alias corrupti ut minus aspernatur non ab magnam nihil sit aliquam repellat vel dignissimos eos cum ut voluptatem eveniet fugit asperiores et non est ut quis ullam sit fugiat rerum sed ut exercitationem quis ut magni ut repellat mollitia architecto velit eius tempora cum nostrum reprehenderit nulla veniam assumenda esse necessitatibus quod itaque sint nemo omnis quas aperiam id libero aut odit sapiente et consequatur earum quidem error laboriosam aut consequuntur ut veritatis aut iste sit et delectus ut ratione assumenda corporis et aliquam odio fugit cum molestiae reiciendis quis sunt suscipit deleniti at sit commodi sunt qui voluptate alias harum voluptatem sit sed et reiciendis et dolor quas rerum dicta sit autem iure voluptate voluptatem.', '0', '2017-05-02 22:59:11', '2017-05-02 22:59:11');
INSERT INTO `course_news` VALUES ('467', '3', 'Quibusdam sequi et ipsum optio sint veniam numquam.', 'Iste corporis doloribus nobis qui dicta quos sint minima ut animi reprehenderit rerum qui et ad qui ut et nesciunt eos quia et et aliquam nihil architecto sed et eaque beatae doloribus est repellat voluptatem non at eum ut temporibus porro aspernatur at omnis distinctio qui adipisci hic voluptas soluta ullam omnis aliquid est veritatis consequatur nostrum blanditiis libero reprehenderit molestiae sit non qui accusantium vel nulla qui eos nobis perferendis repellat consequatur illum deleniti cupiditate eos et aut blanditiis a voluptatem et cum qui aliquid temporibus expedita quo architecto facilis exercitationem consequuntur explicabo et vel et officiis quae facilis in tenetur tenetur et dolorem eos tempore excepturi rerum eum quia deleniti dolor velit voluptatum consequatur voluptatem incidunt est quam aut architecto ut temporibus omnis et praesentium doloremque delectus sunt velit asperiores qui laboriosam qui voluptas qui ipsa assumenda maiores qui neque qui voluptate harum pariatur et itaque qui animi et dicta et quo possimus id voluptas quae aliquam qui dolores blanditiis commodi qui fuga ea voluptatem ad ex veniam dolore accusamus voluptas dignissimos et aspernatur labore repudiandae et vitae consequatur ducimus occaecati sed dolorem voluptatibus ea sed voluptatibus repellat laboriosam amet eos ipsam asperiores sunt cum laboriosam necessitatibus quos deserunt tempora qui et necessitatibus nihil odio suscipit et ipsa distinctio porro aut molestias magni quibusdam distinctio provident rerum dolores similique aut nisi qui deleniti deleniti doloremque quia id vel velit non iure consequatur qui autem libero veritatis ut aut eaque eaque ea nam labore est porro sit doloremque perspiciatis delectus nisi ducimus vero qui numquam ipsum ut molestiae tenetur dicta quidem delectus voluptatem rerum dolorum id velit ullam voluptatem et architecto blanditiis vitae id nam maxime earum blanditiis culpa ipsa alias ea exercitationem explicabo neque quo et et et veritatis officiis nostrum aliquam et veritatis deleniti tempore eligendi pariatur omnis ut aut qui animi porro fugiat nesciunt consectetur est consequuntur esse ut unde sunt itaque sit cum saepe mollitia enim voluptatem praesentium iste accusamus ducimus sint enim ducimus quia est delectus corporis neque enim quos repudiandae voluptates et maiores voluptatibus perspiciatis aspernatur itaque expedita sit qui dolores modi.', '1', '2017-05-02 22:59:11', '2017-05-02 22:59:11');
INSERT INTO `course_news` VALUES ('468', '3', 'Porro quisquam quia illo dicta tenetur.', 'Ut voluptatibus omnis alias consequatur cupiditate non laborum est quas culpa qui quis maiores quia dolorem a eos accusamus vel eligendi dicta aut provident neque voluptate et velit nam et inventore incidunt quas harum eius eligendi rerum cupiditate aut laboriosam nemo vel ad dolorum suscipit officiis nostrum molestiae id harum aut vitae id quia ut perferendis voluptatem sint temporibus blanditiis architecto dolor delectus tempore vel in et et dolorem id assumenda aspernatur maxime aliquam fuga repellendus est soluta facilis sed molestiae sunt est aut aspernatur ducimus molestiae vel cupiditate et sed quia dolor dolor voluptas amet eos non veniam ab rerum harum in consequatur debitis saepe nisi occaecati a repellendus pariatur autem culpa corrupti sapiente qui vel reiciendis inventore similique ut voluptas ut beatae aspernatur sunt repellat sapiente deserunt sunt aut id nostrum vel quod sequi qui eum ex deleniti omnis non qui nemo qui nesciunt sunt eos ut voluptatem temporibus distinctio sed voluptatem qui sed dicta quam quia unde et itaque dolor officiis suscipit qui itaque sint voluptatem aut eos earum et perferendis officiis qui ipsam rem magnam quia rerum ad saepe est quaerat aut aliquid accusamus consequatur est numquam maiores possimus quae ad architecto et animi aut eum ipsa reiciendis aperiam non magni est qui enim et nihil non omnis quod architecto alias voluptatem sunt qui voluptas illum quasi voluptatem minus nam dignissimos dolorem in iste corporis officiis est unde fuga totam et ipsa quibusdam vitae tempora et et ea assumenda qui rerum exercitationem rerum similique quia dolores dolor voluptate est eum tempore aut aut adipisci officia minus minus qui illum voluptas magnam officia et consequuntur necessitatibus architecto cupiditate corrupti et est sit minus consequuntur fugiat illum corporis nihil voluptates culpa quia cupiditate et voluptatem sapiente sed autem in