INSERT INTO `course_news` VALUES ('470', '10', 'Quibusdam iste commodi quaerat.', 'Iusto fuga omnis earum natus magnam odit dolorum quis temporibus sunt quisquam quo suscipit quas occaecati sint fugiat praesentium esse debitis dolorem ipsam hic ipsa ratione consequuntur qui est possimus id similique voluptatem quisquam voluptas consequuntur quo maiores omnis sit vel expedita iure recusandae saepe modi optio dolor sed quisquam rem consectetur eveniet saepe neque corporis eius commodi iusto sed iusto qui quia perferendis et incidunt et quia et ea rerum cum ut deserunt voluptas id delectus et ratione quo distinctio autem ut esse eaque nostrum libero ut non distinctio est esse rerum incidunt sed debitis aut aut ipsam velit repellendus enim et facilis aut quasi nemo et autem dolores sint repudiandae numquam odio ut debitis et maxime repellat dolorem quia modi accusantium porro quod labore at expedita ut dolorem ut officiis voluptatum perspiciatis asperiores aut officia officia qui laboriosam id tenetur magnam suscipit necessitatibus non tenetur atque accusamus vel vel pariatur dolores laudantium quia est nihil nesciunt et ipsa asperiores voluptate ea beatae voluptate ut vel ipsum quia accusamus dolorum recusandae et et quos aut dolores ipsam libero voluptatibus repudiandae quis voluptas repudiandae porro iure sit rem vel aliquid et saepe nisi neque libero aut ullam illo expedita amet aut fuga labore sed qui corporis et perferendis velit quos beatae et natus et ea molestiae doloremque molestiae ipsam eum ut voluptas repellat est ipsam dolorem sequi et sequi delectus numquam alias voluptatem et molestiae temporibus dolorum in earum earum aut porro voluptas laborum consequuntur at aut et est est numquam aut aliquam voluptatem dolorem quas non magni excepturi laudantium illo id itaque consectetur dolores saepe ut cumque sunt omnis soluta eaque animi aut incidunt et dolorem ut harum et et impedit temporibus aut similique quisquam ipsam exercitationem possimus sunt eius sed su