INSERT INTO `course_news` VALUES ('471', '9', 'Enim rem illo et et est dolores veniam a.', 'Veniam fugit ut enim qui alias qui voluptatem asperiores qui eos asperiores repudiandae et molestias neque qui nulla et at et dolorem soluta consequatur id autem et laborum tempore enim illum labore et vero aperiam similique voluptatibus tenetur voluptas id dicta doloribus sit amet perspiciatis nulla inventore non placeat doloremque et velit incidunt facere omnis repellendus esse veritatis doloremque enim et assumenda a culpa omnis et voluptas in iste aut aut error qui quaerat voluptate reiciendis ut neque inventore molestias et quis sed voluptatem perferendis deleniti rem numquam velit et animi et voluptatem et repellendus nihil enim nihil excepturi reiciendis in beatae impedit non qui pariatur nemo harum ut explicabo sint corporis nesciunt at in eos quis ea nesciunt pariatur eum consequuntur culpa aut quas quod dolorum eius aut possimus enim laudantium sequi sed et ut velit beatae doloribus in aliquid molestiae vero et ex cumque qui provident est illo sed numquam ex dolorem in qui voluptatem est distinctio dolorem accusantium saepe et voluptas nemo est ad velit quia recusandae non maxime ipsam earum et expedita repudiandae qui ea velit voluptate molestias est quo ab error quaerat distinctio nobis soluta inventore possimus ea cum nobis reprehenderit nihil est non beatae commodi aut eius nesciunt doloribus voluptatem vitae id voluptatum sed totam ullam impedit reprehenderit vel expedita aliquam fuga numquam optio saepe officia quis maiores quos laboriosam cumque necessitatibus et qui perferendis sed et ea dignissimos itaque blanditiis exercitationem dignissimos enim exercitationem distinctio et odio aliquam quod tenetur atque quos earum voluptas unde necessitatibus et enim ea veritatis veritatis quo minima quidem dignissimos veritatis accusantium est in esse occaecati odit neque fugit sit aut sed error rem rerum voluptates praesentium quo qui temporibus sed et natus et totam 