INSERT INTO `course_news` VALUES ('472', '9', 'Numquam fugit ipsum odio doloremque voluptate eius.', 'Magni aut odit possimus ex voluptatum earum quae explicabo doloribus odit consequatur reprehenderit repellendus dolores quas iure vel quis at praesentium harum porro sunt quo beatae quibusdam fugiat labore est excepturi nulla ipsum cupiditate quia voluptatem enim eos voluptatibus tempore debitis aliquam praesentium et voluptatem id eos error optio repudiandae voluptas sit illum facilis assumenda laudantium officia est nesciunt fuga quo ut velit porro omnis eaque eum eligendi dolores et facere vero aliquam nihil animi numquam pariatur ducimus deleniti aut neque sed in dolorem voluptas et provident quasi laborum consequuntur odit consectetur aliquid corporis ut ipsa cupiditate autem porro quasi est sequi temporibus nostrum accusantium eius consequatur magnam quas et laboriosam quod voluptatum exercitationem enim repellendus repudiandae aliquam quibusdam non aspernatur repellendus laborum dolorum est quis eius qui doloremque dolor in ut velit provident consequuntur aperiam possimus ut consectetur molestiae et nam temporibus placeat repudiandae quaerat sequi incidunt voluptas aut odio nisi rerum explicabo ab nisi et eum soluta quasi autem mollitia maxime quis officia iure dolor magni nam ea dolorem quos et ea exercitationem eum et veniam eos rerum excepturi sit ex culpa dolor rerum omnis sed aliquid omnis enim ipsa est iusto enim beatae a sunt aperiam ullam autem repellat et est saepe magnam fuga doloribus reiciendis reprehenderit natus numquam qui eum doloribus natus ratione perspiciatis eaque ipsam saepe similique in soluta inventore ut et dolorem voluptas minus aut quo eligendi praesentium explicabo voluptates recusandae omnis laborum nemo sed nesciunt aspernatur in possimus similique earum veniam voluptatum laudantium voluptatem laborum asperiores illum repellendus aperiam consequatur nihil quia ex molestias magnam corporis quia consequatur neque enim excepturi iste