INSERT INTO `course_news` VALUES ('475', '8', 'Impedit animi quas reprehenderit eaque quo aut sint.', 'Est earum quo sed ab illo non soluta aspernatur enim voluptatem nostrum nihil voluptatibus officiis quis velit sequi distinctio sapiente explicabo saepe et mollitia tempora nisi omnis veniam culpa eveniet ipsam quia vitae aut quibusdam minus voluptatem autem enim facere expedita quisquam modi explicabo laboriosam adipisci quo iusto dolor sunt architecto dolor quasi similique illum sit tempora et quisquam ullam dicta rerum quas ex corrupti officiis est ut quidem atque ut quo eum dignissimos et autem ex totam distinctio libero voluptatem rem asperiores et sed saepe beatae et voluptate aut numquam dolores aut quisquam corporis placeat repellat praesentium id et at est possimus aut qui et quo sunt nulla nesciunt non id aut occaecati cumque praesentium aut harum nihil fuga ipsam aut molestiae recusandae consequatur a quas quos corrupti neque et vel et harum nulla rerum qui vel aut in quod dolorem nisi eligendi sed aut sit esse accusantium vel earum voluptatibus cupiditate dolores saepe sit eos ratione suscipit reprehenderit rem perspiciatis non recusandae occaecati eum voluptatem consequatur enim cum inventore ad nulla placeat esse laboriosam et non officia deleniti atque impedit est libero esse est qui iusto debitis voluptas voluptate rerum delectus eum repellendus sint cumque et voluptate repudiandae eveniet ut esse pariatur laborum consequatur neque dolor magni ut iusto nisi quis est a dolor ullam porro esse eos earum maxime amet et quis soluta et consequatur distinctio expedita quod quam omnis veritatis voluptatem eum et repellendus nihil neque nemo tempora aliquid suscipit voluptatem consequuntur delectus commodi eaque tempore ut id tempore culpa nam fugit quia deserunt magni earum sed autem quia voluptas dolore voluptatem dolores vitae minus perferendis corporis non rerum ut amet amet aut nobis vel fugit neque omnis dolor a rerum tempore soluta quo incidunt delect