INSERT INTO `course_news` VALUES ('476', '8', 'Distinctio harum consequatur iste enim.', 'Veniam aut a consequatur voluptatum asperiores quas temporibus inventore neque saepe et sunt ut et natus quisquam aut ut debitis ut ipsa laborum quis error dolores dolorem voluptatem error aut error tempora sint consequuntur et architecto ea aut veniam quis ipsa quo et voluptas deleniti incidunt unde quae ducimus ullam quae amet ut explicabo qui nam vel corrupti ut velit neque cupiditate perspiciatis ea provident molestias nostrum autem nihil qui dolores quia minus distinctio adipisci sed ut ut qui ratione rem velit sed nesciunt sit architecto odit sapiente est delectus ut cumque earum repellendus magnam corrupti et quisquam et totam ut sint esse dignissimos impedit perspiciatis voluptas velit qui aspernatur ipsa voluptatem praesentium deleniti amet incidunt quas alias dolor ipsam eligendi et sit maxime quis nobis pariatur deleniti qui tenetur ut et vel tenetur corporis qui deserunt omnis incidunt sed debitis ut dignissimos provident corporis aut ipsam voluptatum quos exercitationem totam soluta vel tempora est est sunt non harum explicabo dignissimos odio minima est tenetur et alias nihil deserunt sed quod ut eum iste ipsa vero omnis sed est architecto neque amet et at qui excepturi eum nobis voluptas atque molestiae mollitia odio molestiae recusandae minus sed omnis dicta porro libero eligendi illum rerum adipisci qui culpa numquam corrupti nisi magnam velit aut sit quia rerum optio.', '1', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
