INSERT INTO `course_news` VALUES ('478', '3', 'In est et itaque et sit qui aliquid.', 'Explicabo consectetur aut et beatae est dolores cumque iste doloremque iure dolorum aperiam porro at ipsum quos eum eum velit ut minima nesciunt voluptates esse rerum sed veritatis laboriosam quia natus omnis temporibus perspiciatis dolores et quisquam pariatur fuga quia consequatur eius qui cum minima quae et perspiciatis illum assumenda pariatur necessitatibus officiis aut esse quidem id ex ipsa earum aspernatur eos facere voluptatem nemo quia amet dolor ad eaque repellendus enim suscipit laudantium eos porro deserunt sapiente fugiat voluptas eos quia doloremque tempore soluta ratione aut consequatur totam aliquid corrupti veniam et aut possimus dolorum modi optio tempore sit omnis corrupti ut reiciendis amet fuga quasi dolores earum esse voluptatibus dolores explicabo itaque recusandae id inventore id ipsum minima est iusto nemo eius aut maiores sit a tempora repellendus quidem et et mollitia ut commodi nobis quis quod eveniet aut qui delectus a beatae sint asperiores eos autem quibusdam facilis repellat eum pariatur exercitationem vero et sequi fugiat ratione distinctio expedita et sequi et perspiciatis molestias deleniti occaecati architecto veniam voluptatem corrupti assumenda et et inventore voluptates sapiente vel velit sunt accusamus deleniti eum animi saepe eaque architecto rerum voluptas sunt optio delectus ipsam officia aut nobis consequatur molestiae maxime quae quo ullam non quisquam at illo molestias voluptatem labore enim odit qui quisquam doloremque ex et dolore et deserunt repudiandae quaerat omnis facilis animi officiis atque adipisci quia fuga perspiciatis dolor non aspernatur doloribus placeat doloremque inventore quod voluptas nihil perferendis at ipsa et labore neque et omnis dignissimos expedita esse repellendus neque ipsam quis et et voluptatem consequatur repellendus dolores maiores sed sit architecto cupiditate rerum harum vitae ea ut dolorem sed et volu