INSERT INTO `course_news` VALUES ('479', '10', 'Laborum corrupti sit dolorem possimus accusamus.', 'Rerum consequatur et consectetur et sunt molestias deleniti ipsum incidunt fugiat inventore quis ipsum dolor et suscipit sit illo molestiae illum velit veritatis unde officia atque qui est dolorem velit est odit temporibus totam excepturi sint odit ipsa deleniti odit quia consequatur doloribus veritatis nihil omnis vel voluptas officia laudantium voluptas quis nobis corrupti et eos eos quidem rem reiciendis qui et rerum eligendi dolorem consequatur deleniti voluptatem rerum facere labore ipsa error odio harum distinctio rerum impedit quibusdam nam et deserunt dolorem sint deserunt aut molestias animi amet eligendi cupiditate cumque sint sint omnis at voluptas dolorem repellendus dicta maxime quaerat odit impedit laudantium maiores enim tempore iure tenetur non officiis minus quaerat dicta aut sint qui doloribus dolore sit delectus cupiditate amet sit minus ex assumenda eveniet est odio et nam sed nihil cum autem in quia culpa sint aut est exercitationem et ipsum delectus in rerum reprehenderit a soluta veniam doloribus sit molestias dolorem sequi nisi quia velit fugit amet distinctio dolorem rerum qui officiis vel aspernatur inventore ut sit doloribus ut quis ea aliquam quis minus perspiciatis natus non libero error illum libero nostrum consequatur rem sit qui aut rerum sed in qui voluptatem sit quae quis magni pariatur veritatis dolores voluptatum libero libero explicabo dolore aut ducimus nihil maiores quia explicabo tenetur et veniam cum et vero rerum iusto et esse temporibus molestiae sit ipsum nobis mollitia veniam voluptates dolorem libero exercitationem animi magnam porro in error et neque et iste doloribus aut nisi nesciunt tempora aut quos nisi repellat asperiores minus consequatur tempora ad possimus magnam aspernatur ab sunt voluptas non sint nihil aut non laborum et neque voluptas alias soluta aliquam hic ut dignissimos aliquid nihil sed unde facilis et ab