INSERT INTO `course_news` VALUES ('480', '2', 'Incidunt id adipisci repellendus et quibusdam velit possimus.', 'Enim omnis sed natus nemo occaecati deleniti aut omnis et eligendi occaecati nisi enim esse vel temporibus voluptas quam quasi atque animi dicta ex ipsum officia tenetur provident unde sequi suscipit perferendis ut impedit quasi magni dolor provident optio amet enim qui eius quia velit sed eos eos nisi consectetur atque nisi fuga vel ab dicta exercitationem autem repellendus maxime tempora debitis laborum nihil quia amet officiis deserunt suscipit consequatur qui accusantium dolore natus numquam libero eaque culpa facere vero et sint voluptatem est quia asperiores sed possimus maxime impedit voluptas at esse sit ut consequatur quos optio quo velit ipsum iusto optio minima voluptatem et repellendus sit velit corrupti ut animi consequuntur quia enim quis officiis sunt doloribus qui quo numquam quia temporibus voluptas explicabo eos dignissimos consequuntur doloribus architecto dignissimos omnis impedit labore enim enim est nihil natus nesciunt autem ut animi sunt quibusdam iste eveniet quaerat aliquam fugit est est consequatur eveniet nobis a sit ullam iusto porro excepturi tempora sint error alias est est et illo beatae quaerat et minima porro cupiditate sint a provident qui et omnis natus quae dolorem veritatis ipsam sit quod qui qui officia quas mollitia eos voluptatem officia suscipit numquam at sint et incidunt libero ratione accusantium labore eveniet ipsam eos qui nulla in consequatur consequatur neque nemo cumque dolor mollitia exercitationem quia sit quibusdam architecto atque aliquam repudiandae quae odit numquam odit quo autem dicta et qui voluptatem et consequuntur quaerat distinctio et deleniti ipsa quo dolores nam enim qui totam culpa quia beatae necessitatibus in.', '0', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
INSERT INTO `course_news` VALUES ('481', '8', 'Odit officiis distinctio sit reiciendis est.', 'Dolores numquam dolores voluptatem explicabo velit aliquam eos saepe sequi incidunt voluptatum delectus necessitatibus possimus enim nesciunt provident totam ut labore quia voluptatibus soluta occaecati occaecati officiis saepe earum natus libero et at explicabo aperiam iste molestiae excepturi voluptatibus id aut qui ab minus unde nihil expedita quia aut nemo quia inventore est ut et labore inventore voluptates quo voluptate voluptatem consequuntur provident tenetur exercitationem sapiente labore maiores vel suscipit qui quis ab labore necessitatibus sed molestiae veritatis qui et dolores ea eaque sed quisquam velit minus quia fuga architecto fuga molestiae minus velit voluptate autem perspiciatis sed velit voluptas omnis a quisquam non unde molestiae illo quo culpa a incidunt et ipsum explicabo fugit quia reprehenderit nam ipsam minima aut rerum qui laborum quia nisi dolores ullam doloribus quidem saepe et eos distinctio error vero sit placeat corrupti ipsam sed repellendus ut consequatur ea omnis similique accusantium voluptatem rerum temporibus nam eum facere cum enim hic voluptates eaque unde et ducimus suscipit adipisci maxime excepturi omnis quis accusantium eos fuga laborum dolor doloremque quidem veniam est sapiente eius delectus saepe ullam amet possimus architecto sit consectetur rerum est voluptatem omnis iusto sequi id provident nesciunt distinctio aut cupiditate necessitatibus ex error et dolor sapiente dolorem cumque quas blanditiis in provident labore nobis enim consequuntur sit nesciunt voluptatibus in assumenda deleniti omnis qui voluptas vero possimus dicta cupiditate molestias odit qui vel quo pariatur maiores voluptatem atque est dignissimos minus dolores saepe voluptas harum vel aut soluta non repellat magnam aut sed qui vel reprehenderit nihil voluptas cupiditate praesentium ea adipisci nisi odit magnam officia et rerum eligendi aut dolores deleniti odio et voluptates rerum nesciunt nulla cupiditate repudiandae laborum ut id atque rem nesciunt delectus ipsam earum cupiditate accusamus amet nisi aut officiis expedita sit voluptas animi optio fuga maxime dolor recusandae voluptas facere reprehenderit aut et dolorum tenetur maiores deleniti rerum sunt accusamus eos voluptatem itaque est et sunt ea ipsum animi nulla suscipit vel totam ut voluptatem natus pariatur enim id repellendus quam sapiente est perferendis eum aut ut a tempore et tenetur aliquid autem eos adipisci dolor repudiandae repellendus repudiandae perferendis rerum modi et.', '0', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
INSERT INTO `course_news` VALUES ('482', '6', 'Iure cupiditate inventore eum porro ut.', 'Maxime possimus expedita ut soluta et sed non ut necessitatibus odit et labore doloremque repellendus natus et voluptatibus inventore id omnis quas expedita quia voluptas quod iure alias amet vel ea sed eos qui harum qui ut et consectetur eum fuga ut aut aut voluptas soluta non natus similique minima possimus saepe ipsum consequuntur repellendus rem est dolor numquam consequatur et et inventore alias natus amet maxime necessitatibus quos qui aliquam iusto et reprehenderit fugit qui provident blanditiis ut rerum corporis tempore asperiores tempora porro expedita quia libero et odit aliquid in placeat cum rem iusto labore omnis qui voluptatem repudiandae laborum voluptate ratione consequatur quam fugit voluptatum voluptates eaque non aliquid harum dignissimos totam est odit aut occaecati eius quasi molestiae quaerat ea iusto minima quos et dolore cupiditate veritatis explicabo reprehenderit architecto tempora perferendis consectetur consequatur est omnis sint dolor laborum ex dolor quisquam nulla voluptates laboriosam maiores totam voluptatem aliquid et deserunt autem magnam quam architecto suscipit aut aliquam eveniet ex sed animi assumenda exercitationem repudiandae quae atque est veritatis voluptatem sequi optio dolorum in est dolor quia.', '1', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
INSERT INTO `course_news` VALUES ('483', '4', 'Quos necessitatibus quo nobis.', 'Voluptatibus omnis quia expedita soluta veritatis placeat minus tempora labore at laboriosam voluptatem doloribus et deleniti adipisci et maxime totam soluta qui consequatur quisquam corporis amet iusto et reprehenderit autem delectus exercitationem autem est minima sit reprehenderit aut quia ex commodi odit alias et cumque quia quis labore fuga nihil enim et et similique itaque dignissimos voluptas eos pariatur perferendis et qui quo laborum repellat delectus perferendis tenetur quasi qui nesciunt aut consequuntur soluta est commodi explicabo est est optio ipsum quos laboriosam laudantium in ipsam dolorem iste excepturi esse laboriosam aliquam nostrum quae illo recusandae molestias architecto ut ea culpa vel et voluptas cum nostrum cupiditate dolore nam sit nostrum quaerat velit et hic et tempore consequatur quia inventore inventore sed possimus aliquid maxime consequatur sit maxime voluptate est repellat vel quis provident id necessitatibus itaque quia eos illo ex et totam fugit deleniti rerum in voluptates ullam nihil sed exercitationem molestias nulla accusantium voluptatem sunt officia sunt velit voluptates molestiae quisquam fuga error aut quis est illum iure ipsa voluptas similique aperiam nisi ratione soluta eum cum iure ullam et eos officiis nam quo asperiores qui voluptatem eaque nihil sint doloribus optio sed saepe recusandae non voluptas a et rem sit maxime mollitia modi at accusamus non assumenda rerum et neque dolorem est voluptas facere nihil expedita commodi nisi tempora debitis.', '1', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
INSERT INTO `course_news` VALUES ('484', '9', 'Nisi perferendis veritatis voluptate laudantium et.', 'Eius eum excepturi aliquid consequuntur ut commodi similique expedita mollitia quia error eum dolor qui et aut odio modi maxime corporis aut cum velit rerum labore quia est nam vero quod hic enim repellendus quia rem reiciendis culpa ut ipsa dolorem aut veritatis ipsa nihil ex ea at dignissimos non et qui quis eius animi et qui consectetur et occaecati inventore minus corrupti praesentium ut ducimus aut velit sit similique occaecati ratione voluptates temporibus id fugiat et culpa placeat omnis suscipit totam deleniti qui consequatur beatae aut officia hic inventore dignissimos qui libero laboriosam iure aut itaque aperiam nihil facere dolore sed dolores et aut eos quia provident consequatur sit nostrum explicabo eligendi pariatur blanditiis eos qui alias impedit ut dolor magnam ea suscipit sapiente ad dicta odit eum aut minus quo esse nihil rerum exercitationem magnam odit optio fuga debitis eos totam ut ut quia et et commodi provident assumenda sint et ut ut at est aliquam est maxime quibusdam deserunt eos nulla facere officia alias voluptatibus placeat tempore ex error ad itaque molestiae tenetur quo blanditiis modi cupiditate soluta et ut molestias et aliquam aut molestiae ex nemo error et consequatur est dolores est explicabo velit veniam voluptas nulla quaerat minima ab nisi vitae quibusdam ut explicabo assumenda officiis excepturi consequatur et qui ducimus enim rerum accusamus cupiditate eligendi vel velit vero voluptas amet vel sit non est soluta at sed in et necessitatibus ut eligendi ut culpa necessitatibus a tempore sit impedit sed reprehenderit in omnis officia dignissimos dicta et consectetur nostrum rem doloremque ut magnam ad blanditiis ea illum qui dicta iste itaque ad quasi praesentium et sit repudiandae et pariatur dolor quo eum nulla sapiente sit quis ipsum harum quasi illum maxime labore qui nesciunt facere qui est error eligendi tenetur ea aliq