INSERT INTO `course_news` VALUES ('485', '4', 'Molestiae voluptas corrupti esse quidem qui enim nam.', 'Tempore labore ratione exercitationem voluptatem dolores dolore est cum ut impedit voluptas et omnis quisquam id officia et asperiores officia nostrum aut sequi sit ullam dolorum natus vel eum et facilis ut eos dolor quibusdam saepe laboriosam ipsam perferendis vero alias sit laboriosam voluptas in sed odit temporibus ut et ut aut quo est adipisci quas aliquid sint alias facilis minima quo architecto vel in optio nostrum qui ipsam doloribus dolor ex in nostrum enim sit nemo enim fuga quae deleniti aliquid eos est est sed debitis minima a consequatur eveniet molestias aut et ut magnam nam voluptatum eligendi alias est explicabo nihil et natus a impedit dolor fugit laudantium hic sed et omnis nostrum voluptas a architecto magnam mollitia minus dolores et labore error et in quaerat dolores laborum amet facere dolorem corrupti et dolorem voluptatem voluptatem nihil architecto cum voluptatem sunt culpa est sed similique quo sapiente laborum quidem a soluta rerum modi suscipit voluptatem aperiam quod ut quaerat quis aut maiores ipsum voluptas labore ullam et voluptatem sit incidunt a vel quasi nemo et deleniti necessitatibus odit voluptatem odit aliquid sapiente atque in sequi eveniet adipisci quaerat optio maiores nam itaque aut quisquam aperiam id deserunt assumenda distinctio nisi ad adipisci voluptatibus eaque quo qui accusantium architecto qui reiciendis quaerat officiis nesciunt cumque quo maxime illum perspiciatis autem rerum eligendi neque ut maiores consequatur dignissimos ad non ut sint aperiam et ut maxime blanditiis aliquam deleniti deleniti consectetur ipsa repudiandae dolores enim est harum distinctio aut et accusantium non aut delectus earum voluptatum perferendis at deleniti voluptate assumenda eveniet nihil vitae nesciunt quia recusandae ea accusantium ipsum sunt facilis quasi velit et sit officiis sunt deserunt quae et iusto quam aliquid iusto officia ut ut quis qui fugiat quam ullam temporibus cum tempora aperiam dolorum dicta eveniet cupiditate ut et dolore dignissimos eius a aut voluptas perspiciatis rerum temporibus quia nihil aut repudiandae esse necessitatibus facere repudiandae dolor quia dolorum voluptatem occaecati harum qui in sit rem quidem optio exercitationem autem omnis excepturi veritatis quaerat ut dolore voluptatem dolor reiciendis quo aut eligendi omnis laudantium sint animi corporis ut officiis est impedit laboriosam facilis mollitia expedita eius pariatur eius facilis ut qui molestias et fugiat incidunt sed assumenda recusandae cupiditate voluptatum delectus aut quo sint aut praesentium sunt accusamus ut aperiam consequatur ut debitis molestias laboriosam voluptatem facere quia aspernatur debitis quia voluptatum sapiente omnis eius illum qui cumque sunt consequuntur molestiae dolores officia et voluptates id aut voluptate.', '1', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
INSERT INTO `course_news` VALUES ('486', '9', 'Velit dolorem sint laborum est praesentium.', 'Aliquam reprehenderit autem laborum nesciunt velit quod dolorem dolorum optio expedita quod error eos rerum inventore molestiae qui voluptatem accusantium qui quasi debitis sit labore qui doloremque quibusdam aliquam dicta hic ducimus maxime deserunt ab deleniti beatae molestiae sit aut voluptatem omnis distinctio saepe quaerat nobis consectetur est cumque enim aut vel adipisci quam distinctio officiis mollitia vitae aut sed suscipit neque harum quia ut repellendus asperiores quis possimus atque saepe eligendi animi vero facere voluptatibus sint voluptatem et voluptas sint eius omnis reprehenderit veritatis est est voluptatem sed et culpa facere saepe voluptas doloremque quia impedit non inventore nisi provident libero sunt soluta modi quo quidem est aut rerum laboriosam facilis et vero fuga ipsum animi tempora quisquam nulla saepe adipisci et at aut consequatur dolores cupiditate facere perspiciatis id enim id est quia quod et voluptates voluptas culpa ipsam facere repellat facere deleniti sit aliquid at numquam autem reprehenderit quas sunt tenetur incidunt delectus rem corrupti alias atque dolorem ipsum sit pariatur voluptate quidem hic eum aut perspiciatis et voluptas voluptatem eum ut dolorem a voluptatem aperiam alias cumque quasi odit minima non quia ea quod placeat qui numquam est labore eum dolore dolorem quia est rem est quidem autem adipisci et rem earum soluta repudiandae ut omnis sit qui perspiciatis explicabo labore voluptatem aut est ut explicabo excepturi ad nemo dolores pariatur ut sequi consequatur et sunt aspernatur aliquid ea id unde saepe asperiores voluptates.', '1', '2017-05-02 22:59:12', '2017-05-02 22:59:12');
INSERT INTO `course_news` VALUES ('487', '8', 'Numquam quod et animi est voluptate eius.', 'Reiciendis dolor eaque ut dolorum temporibus quia nesciunt facere odio hic voluptates iure minima sint qui et est architecto pariatur sint quaerat illo molestiae sunt quia inventore pariatur tempore voluptas sed modi id exercitationem assumenda aut a et et impedit natus perspiciatis dolorum occaecati est laudantium ut assumenda similique aut nemo et iure consequatur ex culpa sit nulla et natus ea non consequuntur ea quam error sit quidem culpa officiis qui id sint aut vitae atque facere rerum reiciendis nesciunt ut maxime hic quidem et sed inventore nostrum modi est ut sed dolores exercitationem et laboriosam accusantium adipisci ipsum omnis vitae quidem praesentium sunt quo distinctio vitae vitae expedita veritatis non itaque molestias sit veniam aliquam sed rerum nihil officiis accusantium eaque deserunt optio ea pariatur aut quibusdam velit consequatur maxime ipsam sed praesentium rem et et sint dolor excepturi enim deleniti rem facilis ad harum unde minima libero sit eum error quis eligendi magnam facere incidunt occaecati id omnis id magnam est atque temporibus occaecati ut aut minima optio ducimus aut est aut et aperiam similique harum corporis et omnis qui qui quidem et quia animi est iusto ut dolorem aspernatur adipisci rerum neque sit officiis quia et itaque tenetur voluptates tempore ratione animi repellendus dolorum quia totam quod sed eligendi accusamus vel cum molestiae dolor eos harum tempore magnam mollitia explicabo in itaque nihil tenetur quidem in corporis sit asperiores laboriosam et ipsam modi amet eum excepturi eos quo est qui repellendus voluptatem et qui nesciunt iure quis aliquam at nobis non optio consequuntur amet et voluptates ea aut provident omnis omnis earum sed ab vero eum perspiciatis qui qui provident explicabo aut voluptatem non iusto dolorem voluptas non ullam dolor veniam quaerat voluptatem non illo qui blanditiis ratione doloremque quia necessitatibus quia quo dolorem rerum porro quas suscipit doloribus hic voluptatem laborum nobis ut aliquam consequatur saepe ad commodi laudantium at quia maxime voluptatem nobis repellendus libero aut sapiente tenetur adipisci et minus minus dolorem alias dolorem eius impedit totam voluptate ipsam excepturi a similique nihil reprehenderit et sint magnam et aut facere vero animi tenetur voluptatem quia dicta quia alias et quia in sint quia quo magnam maiores corporis quis repellendus perspiciatis nostrum nihil nisi sint animi blanditiis error excepturi ducimus voluptatum ut velit est ut amet est quae et et et reiciendis est recusandae est cupiditate recusandae esse quos adipisci voluptatum recusandae rerum ipsam commodi.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('488', '5', 'Dolorem et nostrum doloribus et unde minus.', 'Sint consequatur ex et debitis iusto necessitatibus autem vitae neque quaerat numquam facilis a quae aut molestiae ipsa excepturi libero in et porro ut quod minus at enim quibusdam est quia dolore eos est ex et officiis necessitatibus assumenda quae est vitae enim architecto corrupti repellat fugit tempora ipsum recusandae magnam delectus magni modi placeat ullam iste eos nostrum odio nobis non doloremque eligendi dolor recusandae dolorem enim sed animi provident quod asperiores dolorem quaerat iusto et necessitatibus ut voluptates magni mollitia et error perferendis blanditiis ipsa asperiores reprehenderit mollitia voluptatem pariatur id voluptas facilis qui vel illo aut perspiciatis quia aspernatur quaerat quis ea molestiae quia aut officia adipisci sit rerum nesciunt qui quidem hic quia debitis tenetur quos optio labore voluptate dolorem nostrum voluptas excepturi id sed sequi blanditiis et iusto unde dolorem itaque ipsam et qui nisi sed neque exercitationem eum quis cumque non facilis aliquid tempora dolore est eos dignissimos ut doloremque sit ut perspiciatis aperiam voluptate sed doloremque quod in debitis et consequatur qui quos unde inventore et aliquid ratione facere autem quisquam quia labore reiciendis repellendus accusantium ut et rerum qui accusantium est provident pariatur quo sint voluptates error consequatur vero eveniet aspernatur molestiae repellendus reiciendis tempore delectus repellat autem tenetur perspiciatis sit et accusamus dignissimos odio sit commodi aliquam enim aperiam est nobis velit ab cumque architecto voluptatibus neque aut dolorem ut quis dicta perferendis quam qui magnam non facere est sit nihil exercitationem.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('489', '6', 'Eos consequuntur quia facere officiis aut facere aliquam.', 'Non temporibus veniam in earum ipsam itaque eum ad facilis qui ipsum error totam doloremque non nihil eum omnis sit placeat sunt autem quis esse suscipit sit non quas omnis ratione itaque beatae est in et aut ut aut voluptates saepe iure sit quo explicabo qui aspernatur vel rerum tenetur perferendis assumenda debitis maiores deserunt ea eos est qui consequatur illo quidem ut perspiciatis reprehenderit aut iusto consequatur nam molestiae dolores aliquid aut ex cum a et eligendi adipisci adipisci dolorem quidem facilis aut repellendus reprehenderit eum provident aliquam ut dolore id aut aut dolorum totam sunt dicta non non officia aliquam beatae autem aut nisi reiciendis excepturi quasi accusamus in corporis quisquam architecto eveniet earum omnis dolore et ut perspiciatis nemo quibusdam eos eligendi voluptatem unde repellat ex aspernatur nam molestias esse numquam impedit adipisci animi debitis voluptas aperiam reiciendis et ut ipsa esse dolor et aut possimus voluptates ea asperiores quo est iusto sit porro autem ad et fuga autem ea blanditiis at tempore et minus est incidunt ut eum nostrum et quibusdam dolores optio deserunt asperiores soluta ullam molestiae veritatis delectus hic ea repudiandae nisi a autem impedit aut voluptatibus quis incidunt corporis consectetur eaque a suscipit et facilis sunt in soluta repellendus assumenda aut ea odit ipsa beatae dolorem harum qui placeat nulla est odit aut architecto accusantium consectetur aut debitis recusandae asperiores ipsum et.', '0', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('490', '5', 'Non facilis rerum porro excepturi enim.', 'Et aspernatur sunt pariatur velit corrupti occaecati cum quaerat mollitia quod doloremque atque exercitationem ut qui id ullam non voluptatibus pariatur quibusdam qui et suscipit distinctio impedit et dolore aut perspiciatis distinctio voluptatum sint omnis expedita quidem sit ad sapiente dolorem sed dolores accusantium dolorem sint quas repudiandae dolores dicta possimus perspiciatis quia laboriosam eum quia deleniti voluptatem voluptatum unde delectus molestias reiciendis iure est harum aliquid repellendus consequatur delectus quod a est exercitationem fuga libero et vel sed ut sunt porro harum nostrum quo harum quaerat voluptate eos voluptas consequatur aspernatur a vel voluptas atque earum ea vel sit enim labore saepe recusandae mollitia laborum qui quia velit perspiciatis aut tempore perspiciatis est aut suscipit quae unde illum sit odit exercitationem quia voluptate quod excepturi praesentium quo et consequatur velit ea non voluptatum quod libero atque cum quam perspiciatis dolores est cumque quo recusandae soluta molestiae animi id rerum libero dolores veniam accusantium provident reiciendis molestias aliquam harum rem corrupti praesentium accusamus cum natus voluptates voluptatum et sed eligendi possimus vel iusto rem est laborum sit qui dolorem consectetur rerum magnam praesentium tempore voluptatibus dolores et voluptatem est enim quo rerum corporis labore quis fuga distinctio et sed numquam veritatis tempore sapiente impedit vel non nostrum amet magni velit vero voluptas eligendi neque recusandae voluptatem ipsum numquam dolorem velit distinctio vitae aut modi ex velit voluptas in ut quo consequatur deserunt nesciunt aliquam repellendus velit doloribus reiciendis laboriosam voluptatem numquam sit et id illum ut vel et facere excepturi at numquam iste nostrum in rerum deleniti minima veniam minima rerum et ut qui perspiciatis dolorem odio voluptatum in fuga est impedit minus voluptatum est voluptate et nostrum rem unde dolorum deserunt voluptatem provident quibusdam velit et nihil ut nihil laudantium vitae eos in consequatur corrupti eos non laborum suscipit qui ad aut voluptatem sint at repudiandae sequi voluptatum dolores perferendis cupiditate aut eum qui corporis vel doloremque ratione id distinctio id minima ut libero voluptatem ea perspiciatis est blanditiis aliquam molestiae ratione sed et id ab ducimus est voluptate repellendus esse non sit nostrum quod ex et blanditiis est alias labore excepturi praesentium architecto.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('491', '1', 'Quae quidem harum enim.', 'Consequuntur aut non aut et saepe cumque accusamus eligendi doloribus ratione debitis dignissimos est illum nisi nostrum est at vel voluptatem illo aspernatur impedit sint voluptas aspernatur aut eius sed laudantium quibusdam esse perspiciatis officia cumque iusto omnis excepturi esse temporibus unde quos qui vitae nobis explicabo fugiat vel voluptas voluptates rerum dolore perspiciatis autem deserunt et ipsum est blanditiis odio aut cupiditate esse vel facere et dicta est laborum quae enim est ab ducimus vero sed voluptatum sequi voluptate laborum ipsa rerum voluptas quis quam sit dolores debitis deleniti iusto minus blanditiis dolorem rerum enim ab qui recusandae mollitia aut facilis dignissimos non a iste molestiae at repellat non est recusandae pariatur eaque doloremque molestiae quisquam aperiam consequuntur fugit quae sunt dicta excepturi accusamus nihil est occaecati natus culpa quia sit laboriosam non et cum nam quia sit consequuntur asperiores quam et minus explicabo illo sed ipsa necessitatibus soluta modi voluptatem velit consequuntur quia atque reprehenderit tenetur qui ut et ut qui odio atque accusamus distinctio a labore sapiente provident doloribus modi earum omnis voluptatum et recusandae quis voluptas iusto soluta minus neque animi eos voluptatem labore ex excepturi cum rerum aspernatur et quas nulla doloremque eos labore aut aut est perspiciatis sequi in nulla culpa quae a ut consequuntur rem unde est totam accusamus minima odit fugit nulla nemo maxime tenetur tempora quod porro voluptas possimus maxime voluptate et dolor sapiente nam adipisci odit ipsa ratione illo aut quasi dolores enim libero reiciendis pariatur adipisci magnam soluta voluptatum reprehenderit quis labore dolorem repellat mollitia dolorum eveniet ut et optio at at laudantium reprehenderit ullam et iure quis dolor praesentium quas et velit nam nostrum ut mollitia consequuntur illum tenetur veritatis et doloremque dolores rerum sint reprehenderit voluptates facilis voluptatem est ea est error et quasi sunt distinctio quasi et non tempora velit et molestias neque blanditiis iste nihil accusamus dolore esse sit odio tempora est id soluta odio in sit alias quidem est laboriosam porro fuga et sed amet ut vel autem nobis ut possimus qui perspiciatis temporibus doloremque repellat laborum consequatur aliquid distinctio nesciunt magni a eaque vero nisi est quia animi sed ullam et maiores perspiciatis earum doloremque eum quos eum non quaerat neque ea recusandae et at voluptatem.', '0', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('492', '5', 'Aut alias aut aut dolorum.', 'Aut consequatur in asperiores blanditiis saepe sit aut impedit et ratione nihil aliquid alias cupiditate a maxime molestias accusantium doloribus optio tenetur ullam voluptas tempore eaque deserunt possimus error sed fugiat quidem incidunt nihil aut qui nostrum quaerat ea esse distinctio sapiente consequatur voluptates expedita in ut amet nemo quia sed atque impedit molestias repudiandae sed quia quia tenetur et ea vero ut modi veritatis numquam perferendis ad eligendi quisquam est qui aut ratione repellat aut facere et similique cum quia dolores vero tenetur laudantium deleniti perferendis non consequuntur distinctio et eos corrupti non molestiae tenetur dolor iste maxime est eius voluptatem a aut fuga ratione placeat laudantium assumenda numquam itaque dolore repellat est sed aut dolores sit deserunt ex quisquam iusto vel et qui et error voluptatem quisquam ut eos qui soluta eius id in illo doloribus quod rerum reprehenderit exercitationem alias dolor tempora tenetur veritatis culpa illum quia ea nemo harum illum libero alias recusandae ipsam iusto qui qui consequatur dolor est et adipisci et itaque optio veniam sint voluptatem quidem consequatur qui voluptatem iste doloribus et laboriosam debitis culpa est tenetur omnis officiis et corrupti totam libero consequuntur ipsam repellendus distinctio molestias aliquam nisi non non illo animi excepturi.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('493', '10', 'Officiis ducimus sed quam eius et non illo blanditiis.', 'Corporis autem quis nostrum voluptas nam et in nostrum amet aut tenetur veniam quas commodi laudantium ut soluta qui quae ipsam dolores dicta dolor minus dolor inventore alias ab nulla et perspiciatis optio tempore dolores explicabo eaque reiciendis quaerat explicabo explicabo totam velit harum minima laborum nihil libero alias quibusdam sed distinctio voluptatibus consequuntur quaerat cupiditate quas quam et dolore at ratione et excepturi sed quaerat minus consequatur iure velit voluptatem doloribus quisquam reprehenderit molestiae aliquam quia rerum nisi impedit voluptate et in est atque libero aperiam et et repellat nostrum perspiciatis architecto magni et nostrum quae debitis eum consectetur debitis doloribus deleniti sit assumenda enim sed vitae adipisci numquam quia dignissimos impedit dolorum atque illum quo ut ullam eum qui quis minima asperiores et architecto unde quidem similique voluptas numquam rerum et vel tempore repudiandae ut in nemo architecto aut asperiores voluptatum qui asperiores ut dolores corporis et nihil quia in eos sit sed ab voluptatibus quis magnam asperiores enim reprehenderit debitis ea consectetur nisi velit voluptatibus optio dolor est eaque qui id repellat eius doloribus et sit placeat assumenda aut enim numquam vitae provident maxime quae ab nesciunt nemo ipsa est placeat est asperiores assumenda nihil qui iste provident autem non dolor facere magnam voluptatibus beatae veritatis autem dolorem est exercitationem unde officia et tempore et optio eveniet et et a quo animi sed molestiae explicabo in voluptas magni aut quis sint laboriosam architecto sed quas ullam rerum odit quae animi est laborum occaecati magni consectetur repudiandae ut voluptatem beatae reprehenderit facere et dolorem nisi numquam repellendus quas similique reprehenderit nemo voluptas voluptas autem et sint dolorem doloremque et quasi magni aspernatur natus modi eum sunt dolor non optio dolorem suscipit laudantium laudantium quasi non et nesciunt sed dolor doloribus minus fugit eaque quia expedita qui nostrum eum repellat omnis doloremque a explicabo quam labore nulla id aspernatur nisi dicta sapiente nostrum assumenda et asperiores sapiente eos.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('494', '3', 'Consectetur numquam minima impedit id saepe perferendis distinctio.', 'Saepe explicabo eos ea ad accusantium qui quia aliquid quas consequatur assumenda quasi dignissimos neque dolore vero quam autem qui et alias possimus debitis quae tempora ex iure molestiae recusandae architecto suscipit voluptas labore quod mollitia sunt mollitia non perspiciatis veritatis quisquam vel incidunt excepturi adipisci id et iste consequuntur voluptatem ipsam et similique nihil et eveniet eaque animi ratione consequatur blanditiis dolorem eligendi ut vitae molestiae quas et expedita est quasi voluptatem ullam repellat adipisci sit molestiae consequatur sed earum nihil et minus repellat suscipit dolorem commodi nulla eaque iusto temporibus eius expedita nemo cumque natus commodi laboriosam aliquid ut id tempora et accusantium rem esse quia rerum nesciunt recusandae iusto commodi esse sit quo non nihil earum aut consectetur aut tempora corrupti iure qui et sunt voluptatem ratione qui iusto itaque consequatur illum est facilis velit eum quia nulla id suscipit maiores nesciunt aspernatur ipsa totam et possimus sint consequatur et a consequuntur aspernatur labore rerum labore iste saepe dolores enim quidem non distinctio beatae laboriosam enim voluptatum est sed iure enim minus sed temporibus soluta eius quo maiores quaerat qui quasi id recusandae omnis quam ut dolore et corporis eveniet qui pariatur rem fuga id ipsam distinctio et nihil unde iure id repellat quis laborum corrupti nihil laudantium corporis iste ab maiores qui saepe commodi eos nulla voluptates dolorem qui earum velit rerum fugit aut officiis saepe inventore quibusdam tempore soluta dolorum aliquam aliquam sunt perspiciatis et reiciendis molestiae debitis et quasi non eligendi et nihil quibusdam cupiditate et nihil cum voluptate ratione non corrupti in doloribus cumque saepe aut atque impedit pariatur sit similique ducimus explicabo et non rem consectetur quisquam cumque repell