INSERT INTO `course_news` VALUES ('495', '6', 'Pariatur accusamus nobis impedit dolores laudantium.', 'Quisquam officia sit natus ratione temporibus velit id voluptates ut occaecati quo deleniti reiciendis magnam sit reiciendis qui aspernatur non aspernatur error dicta modi quas ut id quis blanditiis adipisci perspiciatis error quod autem veritatis dignissimos atque numquam fugit quam tenetur nulla amet temporibus earum quidem eveniet aut non ab iusto et eos dolorem et et rerum commodi rem et et dolores ad nobis qui quasi vitae sed sint nihil eos nihil rem sit excepturi ut sed aut rerum nihil quia cum consectetur consequatur et ab laudantium quis qui quo quod aut inventore illum et in quisquam adipisci sunt repellendus optio est ea ut quo dolorem aliquid ut error laborum dignissimos consequatur perspiciatis magnam officia facilis rerum voluptate velit laudantium et debitis illum ut quis quas qui consectetur est molestiae aut sunt voluptas voluptatem qui maxime aliquam sed voluptas eos culpa nam blanditiis dolores sunt natus doloremque neque soluta iusto odit repellat corporis veniam velit dolorem sit nesciunt officiis facilis id occaecati in cumque non a blanditiis similique sed dignissimos beatae accusantium doloremque quae natus quidem reprehenderit ipsa et saepe omnis consequatur est impedit nemo natus incidunt aliquid repudiandae fugiat occaecati et laudantium tempora natus dolores excepturi sit vero nesciunt debitis quibusdam ut repellendus sunt distinctio dolorem et at et aut qui ipsa ducimus natus quia sunt sunt rem doloribus ipsum velit excepturi accusantium quia tempora non et ut sed rerum ea ipsam omnis asperiores quasi harum molestiae et et sed et recusandae dignissimos odit esse nesciunt dolor et nemo sed doloribus eaque itaque magnam quasi et sed odit beatae iste non sunt voluptatem impedit distinctio dolorem aspernatur accusamus ducimus dicta quisquam qui corrupti esse eos laudantium rem assumenda est minus modi enim et mollitia ad numquam laudantium rerum nostrum rerum voluptas qui porro doloribus eius dolores dolores excepturi incidunt harum voluptatem impedit voluptate eligendi quasi possimus quam animi vel hic quo ab porro in et asperiores aut consectetur odit nobis nihil architecto maxime placeat consectetur est ullam similique assumenda tempore laudantium ipsa est placeat cupiditate ratione omnis vero aut ipsum expedita deserunt.', '0', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('496', '6', 'Nihil vel nulla dignissimos qui iusto magnam.', 'Odio dolorem qui omnis et provident quas libero beatae iste ut omnis et omnis omnis corrupti nihil sed deleniti et dolorem iste illum ratione reprehenderit velit occaecati ut nobis saepe ut reprehenderit non pariatur possimus provident excepturi iusto ea accusamus modi nobis adipisci aliquid molestiae quasi nulla autem et sit maxime ut et cumque doloribus dolores tenetur deleniti amet cum quas reiciendis laboriosam iste culpa est magni numquam sed aliquam voluptatem est aut iusto sunt ea expedita cupiditate animi veniam quas eos et debitis eveniet eveniet corporis rem occaecati repudiandae dicta doloribus amet et et sit distinctio est eum et quibusdam aliquam dolor enim vero reiciendis laboriosam dolor sint omnis quia labore rerum optio repudiandae odio cumque modi iste ut veniam explicabo qui sed et deserunt rerum ut molestiae dicta non eum maxime aut soluta repudiandae voluptatem et nihil eos et ex eaque magnam amet qui natus error id qui ea nulla et voluptatibus repellat illum reiciendis temporibus id ea assumenda et repudiandae sapiente saepe itaque ut aliquam inventore debitis vero id ducimus vel modi aspernatur ut vitae ad suscipit voluptatem eligendi totam illum quaerat ut veniam itaque eligendi officia est qui molestiae doloribus rerum dolores soluta eius vel facere eius corrupti perspiciatis qui necessitatibus eaque velit deserunt id impedit sapiente.', '0', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('497', '8', 'Quia aut repellendus sed velit sed.', 'Dicta autem in ut exercitationem est velit autem autem autem aliquid ut quaerat reprehenderit explicabo praesentium corporis necessitatibus id sed corporis ipsa sunt sit quia in minus sed dolor eum voluptatem excepturi nemo ratione non tempora qui a consectetur eligendi eum itaque id in libero consequuntur et esse corporis asperiores consectetur magni omnis repellat similique distinctio voluptatibus aut quam non commodi quod suscipit quaerat ipsum ex consequuntur distinctio iusto asperiores commodi maxime maxime voluptatem sunt fugiat excepturi illum beatae accusantium et illum ea modi doloremque enim vel non repellendus perferendis sed sunt ut blanditiis incidunt incidunt assumenda dolor fugit enim dolorem vero quos aliquam quae nulla nulla qui est cum occaecati rerum non voluptatem ducimus nulla quod a reiciendis harum nam aliquam nostrum voluptatem quisquam nobis voluptatum sit laborum aut ut necessitatibus porro praesentium recusandae aut praesentium asperiores minima qui aliquam sunt est commodi et incidunt recusandae dignissimos voluptate aut veniam pariatur corporis rerum quia et eos saepe dignissimos est laborum perspiciatis consequatur et autem laudantium in porro debitis reiciendis provident ut dicta veniam tenetur eaque tempore quos officiis dicta nesciunt qui rerum commodi modi culpa aut cupiditate et odit aut maxime voluptatem quam recusandae excepturi perferendis dolores numquam voluptas harum aut earum sit dolorem et quae voluptatem corporis aut nihil velit dignissimos rerum nobis doloribus reprehenderit sint dolorem ut voluptatem nihil dolorem quis molestias mollitia reiciendis mollitia ut est saepe eveniet non perspiciatis reprehenderit quam laudantium laboriosam occaecati est incidunt illo unde odit voluptatem provident ullam repellendus nobis quaerat dolorem ut sed rerum dignissimos ex consequatur aut quaerat distinctio deleniti voluptatem iure omnis voluptas tem