INSERT INTO `course_news` VALUES ('498', '2', 'Placeat incidunt veritatis debitis rem dolorum sunt et voluptas.', 'Nemo vero libero quae dicta ut dolorem debitis quisquam illum qui non dignissimos voluptas consequatur pariatur corrupti perferendis optio nihil maxime ducimus maxime error dolorum officia dolore explicabo hic quibusdam veniam sint eius repellendus nihil labore et aut voluptatem exercitationem rerum officia doloribus consequatur in omnis totam dignissimos sed doloribus iste et iste odio officiis itaque ex repudiandae consectetur est dicta sed aperiam id error laborum perspiciatis unde sed esse ipsum aut consectetur velit quo autem quis nesciunt voluptas officia aut qui ut porro laboriosam repellat beatae rem accusantium ullam vitae nemo pariatur sunt eos sapiente facilis repellendus quaerat repellendus ducimus dolorum fugiat doloremque eveniet dignissimos ea aut voluptatem velit quasi doloribus beatae fugit ut nihil repellat nam a hic omnis architecto et qui officia voluptas at est esse aut id et aliquid et eos provident porro consequatur enim aspernatur aliquam repellat fuga adipisci incidunt est optio est porro iure repellat nisi aut eaque qui repellendus necessitatibus non assumenda quas voluptatem necessitatibus est qui excepturi necessitatibus dolorem sint in nobis neque voluptatum quam tempore quam eum modi ut et accusantium sit et velit at recusandae blanditiis eligendi voluptatem velit odit quia modi sapiente.', '0', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('499', '9', 'Velit blanditiis odit recusandae voluptas commodi et.', 'Quod dolores nihil aliquam est mollitia cum beatae voluptates sequi et deserunt rerum quod non eligendi ut consequuntur laborum voluptatem rerum fuga et in tempore quod sint et nihil ab et aut iusto sit voluptatem velit autem qui quia magnam autem sequi ad fugiat sunt odio exercitationem placeat est corrupti fuga aliquam vero autem qui et est commodi ea aut ipsum iste qui suscipit aut voluptas autem eum maiores laborum accusamus dolorem dolorem itaque voluptatem rerum ex necessitatibus totam aut doloremque repudiandae autem excepturi aut pariatur doloremque accusamus saepe quidem qui dolorem vero earum ex ut hic sed id consequatur accusamus provident molestias recusandae repellat saepe illo est facilis rem nemo quos dolorem ut rerum itaque quae consectetur itaque iure occaecati earum eius aperiam alias voluptatem ad est aut placeat eaque aspernatur libero delectus occaecati voluptas expedita qui aut nulla voluptatem rerum aut fugiat sed et nihil enim magnam velit nostrum voluptas neque quasi voluptatibus sint enim ullam consectetur harum vero inventore harum esse animi praesentium perferendis est maiores sunt quo fugit minima delectus et culpa et quis et sequi harum inventore molestias asperiores necessitatibus quis exercitationem optio libero enim dolorem impedit rerum aut dolorem nihil distinctio similique aut sed aut est aperiam debitis dolorem fugiat consequatur quos voluptatem numquam vel ut est neque non id nobis aliquid deleniti quos nam omnis earum aspernatur dolor quia accusantium deserunt sit.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
INSERT INTO `course_news` VALUES ('500', '2', 'Deleniti facilis voluptatem reiciendis ratione itaque quod aut ab.', 'Vel possimus eum ut ut eius cum voluptate amet corporis sapiente consequuntur dolores fugit perspiciatis expedita maiores consequatur quis accusantium cumque voluptatibus aut blanditiis est vel aperiam est tempore quasi commodi et molestias maxime quia dolor eligendi ad quisquam ut vel nobis sunt ut excepturi laborum fugit consequuntur aut dolorem repudiandae ut ducimus quia amet voluptas laboriosam nihil dolor dicta corporis omnis hic qui deleniti ut occaecati eligendi facere ut non non repellendus ipsa voluptate vitae aut quae qui consequatur aspernatur quam adipisci et minima voluptas aut reiciendis quis consectetur quis corporis harum similique et rerum maxime veniam assumenda voluptas cumque cupiditate aperiam quae velit ipsam dolorum ex dolores reiciendis magni temporibus est natus incidunt et ipsum voluptatem aperiam eligendi sed autem quis accusamus ullam possimus tempora magni animi est voluptas omnis aut dolorum voluptatem exercitationem ducimus ab accusantium laudantium deleniti consequuntur vel provident exercitationem aspernatur dolor aut et sapiente laborum dolorum voluptatem amet ratione suscipit rerum et aut temporibus quia quidem voluptatem ut omnis possimus est amet ut reprehenderit ut numquam eligendi porro repudiandae ratione aliquam id reprehenderit molestias non repellendus ut aut qui occaecati voluptas omnis est sed quos necessitatibus in recusandae omnis eum voluptatibus tenetur vero tempora voluptatibus numquam molestiae nostrum vel aut et repudiandae rerum nesciunt voluptas quibusdam quasi iste natus laboriosam earum nam omnis quo qui amet quis voluptates in nesciunt nulla molestiae sunt sint quas odio velit optio nostrum fugit ipsam temporibus sit autem id sint ab rerum nostrum est eaque reiciendis maxime a atque temporibus placeat id occaecati cumque ut aliquam quia eos earum quia doloribus nulla sequi enim aut enim volupta