INSERT INTO `course_news` VALUES ('501', '1', 'Sint ut asperiores quia vel voluptatem.', 'Sapiente sint nam dolorem minima earum voluptatem similique cum quo fugit rerum laborum iste mollitia nihil id facere fuga quam omnis sunt nisi vitae similique veniam aspernatur est perferendis assumenda sapiente consequatur ex aperiam perferendis labore velit nobis dolorem molestiae eligendi commodi recusandae rerum culpa occaecati laudantium eum sed eos pariatur culpa similique ut excepturi eos molestias voluptatibus dignissimos vero delectus eius consequatur quod ullam quo totam tempore dolorem similique minus laboriosam sit itaque enim dolores et est aut omnis voluptatem ut sed nulla amet asperiores sed accusamus in earum veniam laboriosam reprehenderit tenetur accusantium quia cum maxime qui soluta ut eveniet dolor dolorem fugit laborum possimus veniam sed asperiores quis laudantium fugit tempore sit aut asperiores molestiae itaque consequuntur illum aut possimus esse debitis quo omnis nihil est consequatur et quia aliquid possimus quaerat voluptas sint explicabo ut est architecto doloremque accusamus dolorum exercitationem repellat autem ut ipsum aut eos dolores non quo voluptatem officia quia dolorum qui ratione ut vel hic enim et eligendi libero perspiciatis quo ex tenetur placeat dolorum veritatis voluptatem animi consequatur facere optio sit qui eum asperiores maiores ducimus in ad nesciunt et aut tempora laboriosam quo perferendis aut suscipit et ut dolor unde dolorum molestiae quis qui deleniti itaque omnis nesciunt quia saepe unde quidem similique et soluta omnis nihil in similique qui delectus commodi eum excepturi sapiente voluptatibus vel quidem nulla qui provident mollitia aut enim voluptatibus ad non accusamus debitis quis dolores qui atque et ex consectetur incidunt fugiat eos et corporis possimus incidunt doloremque officiis voluptas in ut in.', '1', '2017-05-02 22:59:13', '2017-05-02 22:59:13');
