INSERT INTO `course_news` VALUES ('510', '7', 'Est et explicabo corrupti.', 'At officia iusto magni fugiat laborum id ea culpa omnis est ut dolor id iste vitae qui sed in itaque temporibus laudantium laborum et ex fugiat exercitationem maiores reiciendis aspernatur quam nesciunt velit est neque molestiae dolore laborum corrupti magnam explicabo tempore qui et esse officia quasi sint similique velit magni mollitia cum recusandae deleniti et modi blanditiis libero labore fugiat deserunt id tempora iusto esse ad quia necessitatibus dolorem nobis sint omnis hic dolores sunt rerum officiis quis ullam ipsa consequatur fugiat soluta dolorem porro eos incidunt dignissimos inventore consequatur consequatur nulla rerum aspernatur consequatur culpa in ut numquam porro vitae sequi qui incidunt ratione qui aut qui facilis dolorem eveniet minima vel veniam ratione sit corporis aut omnis perferendis molestiae dolorem in iure asperiores quaerat corporis ratione quasi quas mollitia qui est est sit voluptatum dolores ex unde in at neque maxime aut quidem porro fugiat in modi itaque doloribus ut adipisci impedit quibusdam rerum commodi recusandae laborum sunt cumque veritatis asperiores excepturi molestias facere voluptatem quibusdam dolores velit itaque porro dolores optio qui vel alias voluptas quos omnis eligendi dicta laborum vitae molestias ex saepe quia voluptas assumenda velit veritatis autem doloribus ex ipsa deserunt expedita est aut et rerum quisquam itaque ipsum quia hic voluptate ratione adipisci tenetur enim consequuntur aut similique reiciendis ut quibusdam exercitationem rerum exercitationem et in autem officiis fuga molestias voluptatem qui exercitationem eius ut possimus ab totam eum fugiat ut molestiae aut voluptas sapiente non sed veritatis illo tenetur sit quis dolores aut voluptas sit est eos aut aliquid quis ad quo dolorem reiciendis et tempore quae recusandae similique dignissimos sit voluptates sit praesentium eaque ut et omnis aut pariatur autem facere pariatu