INSERT INTO `course_news` VALUES ('511', '4', 'Eligendi enim corrupti ea quis commodi repellat.', 'Exercitationem itaque suscipit veritatis repellendus commodi aut molestias eum unde atque eligendi quo illum suscipit maxime voluptatibus rem quisquam eveniet beatae veritatis perferendis pariatur aut corrupti sequi officiis libero eveniet autem aut quis vel sint quasi ut ut ut praesentium molestiae perspiciatis incidunt sit mollitia vel incidunt iste temporibus molestiae ut voluptatibus aut ut ut sit numquam et voluptas nulla et eum dolorem ipsam delectus fugiat dignissimos mollitia quisquam facere perferendis quo quidem ipsum odit ea id quia architecto excepturi et ducimus occaecati nulla in harum et ullam autem et ipsum laborum quibusdam quia et molestias accusamus nesciunt alias perferendis vitae ut rerum harum qui deserunt illum cumque sed et et iusto aut sunt voluptatem rerum totam sit et voluptatem vel expedita doloribus ut repudiandae deserunt architecto quo corrupti facilis adipisci vitae perspiciatis et repellat soluta repudiandae dolorem praesentium error dolorum repellendus ex cum sapiente maxime quo eum natus qui natus ut ipsam quasi quae fugiat qui sunt dolorem architecto qui eveniet asperiores reiciendis esse nostrum numquam velit est sequi sed et eum commodi perferendis ea vel voluptas est non aperiam ut labore consequatur molestias tempora repellat eos et sed eveniet iste voluptatem laborum modi totam iste tempora aut rerum eum maxime quod nulla esse in minus sit non odio esse deserunt sunt voluptatem sint et nesciunt incidunt modi occaecati perferendis dolores asperiores quo autem et eveniet voluptas beatae et dolorem vel voluptas dignissimos aut aliquid quasi alias architecto eligendi cum tempore ipsa cum ut possimus veniam expedita sed id magnam reprehenderit voluptatem qui eveniet corporis dolores modi vel quibusdam architecto ea quia dolor molestiae quis itaque accusantium eveniet sit ipsum aut officia modi saepe non voluptas repellendus sit incid