INSERT INTO `course_news` VALUES ('512', '2', 'Quam sed odit consectetur veniam voluptate amet.', 'Dolor expedita sed dignissimos et accusamus architecto dicta molestias dolores ut qui corporis voluptas qui non quia voluptatem eaque et unde odit et nostrum voluptatem tempora quidem eveniet quidem non repudiandae deleniti officia dolorem ut dolorem velit quo sapiente provident reprehenderit mollitia inventore voluptas et dolores necessitatibus autem delectus quo vitae eius ipsa molestias blanditiis est tempora nam recusandae ea dignissimos libero et et voluptatum ipsa odit necessitatibus dolor amet nulla officia occaecati sed facilis qui vel pariatur tenetur modi eaque possimus voluptates similique et quas ut omnis sunt consequatur quia corporis accusamus quo nam vel et quod est quidem sed nam in beatae laboriosam cumque odio harum illo ipsam tempore ullam ea vitae veritatis saepe eligendi qui molestiae earum perspiciatis ut est ut voluptates facere consequatur dolorem rerum enim iure sit modi dignissimos impedit est tenetur cupiditate doloremque quae aspernatur velit rerum delectus ratione aliquid totam consequatur molestiae non quo dolor est aut quis et necessitatibus possimus aut tempora animi sit est a molestiae autem vitae laudantium sed impedit at reiciendis exercitationem tenetur blanditiis est facilis ut quibusdam inventore officia dignissimos doloremque dignissimos laboriosam totam modi consequatur sunt id ab nihil voluptatibus id dolorem eos ipsam commodi distinctio aut et sed odio et in voluptas sint laborum quaerat enim magni repellat sunt nihil commodi et et repellendus iure culpa sit officiis nulla totam accusantium nulla aliquid excepturi expedita suscipit pariatur nesciunt iusto explicabo aut numquam possimus architecto quo et maxime eligendi eligendi et dignissimos et voluptatem odit sit consequatur earum est numquam exercitationem non tempora fuga architecto eum est maxime itaque laborum occaecati voluptatibus beatae et praesentium ut qui neque reic