INSERT INTO `course_news` VALUES ('513', '4', 'Non aperiam commodi minus tempore reprehenderit.', 'Quia voluptatem est aut placeat minus nobis non in qui molestiae adipisci ut incidunt sit voluptatum laudantium dolorem earum ut voluptatem tenetur est est sit qui eligendi officia vel et sunt amet quis est consequuntur asperiores quae expedita deserunt sed impedit cumque neque magnam voluptas nulla qui nam nostrum at sed vel repudiandae veritatis ipsam illo et et officiis maxime nesciunt corrupti sed molestias possimus nemo ut eaque aut incidunt enim qui totam aut impedit ipsa rerum soluta sed doloremque molestiae libero accusantium adipisci hic veniam consequatur et omnis et enim dignissimos nisi possimus vel et ad ex voluptatem nihil ratione cupiditate aliquid aut quia quod deserunt aut amet ut illo sapiente porro sunt cum qui ea cumque fugiat ut et sed eum magnam nulla consequatur ipsa est alias aliquid repellendus sint nam aut doloribus sed eos ullam necessitatibus quaerat corporis odio eos perspiciatis temporibus ipsam consectetur enim impedit aliquam dolore at reiciendis enim sed molestias quibusdam placeat commodi alias suscipit unde nam dolorem dolorem voluptatem omnis dolorum sed quos quae dolore quae exercitationem consequuntur eligendi sapiente ea corrupti hic doloremque reprehenderit incidunt id deleniti asperiores quas tempora dignissimos reprehenderit earum quaerat iste libero excepturi qui omnis ea dolore dolores asperiores officia ad omnis ducimus quasi quia voluptas et voluptas corporis sunt facilis error in placeat praesentium nesciunt eligendi qui doloribus omnis corrupti laudantium ea voluptates id commodi at earum ullam ratione et voluptates impedit temporibus non sit quisquam delectus doloremque pariatur officia ratione fugit id et autem autem aliquam incidunt voluptas eius illo quia debitis qui animi aliquid nisi suscipit aliquid qui est modi quia qui asperiores rem molestias id beatae nihil laborum non quas atque maxime dolorum omnis et quas in