INSERT INTO `course_news` VALUES ('514', '1', 'Sit fuga sunt quod sunt velit.', 'Aspernatur molestiae est aut nulla rem perferendis numquam est expedita vel perferendis et quibusdam eos nihil inventore autem ut et nisi libero molestias omnis esse dolorum aut quia consequatur numquam consequatur voluptate sint et eius sed laudantium dignissimos quibusdam inventore ut sed eum maiores quod rerum dolorem ipsam sit ad qui sed cupiditate ratione mollitia quis quae rerum sit illum et delectus beatae non atque et fugit sit dignissimos rem qui vel nobis eum assumenda voluptatibus tempora repellendus non harum vitae quibusdam nihil autem ut nihil consequatur sapiente cupiditate animi consequatur dolorem aspernatur numquam quia nisi enim ipsum vitae libero id blanditiis id sed nisi vitae consequatur enim quidem iure reiciendis quas deleniti nihil commodi est vel sint sed repellendus id maxime rerum sequi inventore magnam molestiae quam quis aut eveniet soluta nemo consequuntur aut nisi quia eos autem sint est eos molestiae perferendis temporibus quo cumque modi eaque fugiat voluptates est et occaecati sit labore optio dicta incidunt voluptatem consequuntur assumenda ea non omnis sunt illo quos voluptatem et at ut pariatur atque ea sed quaerat magni unde ullam assumenda ab modi culpa reiciendis dolore asperiores nesciunt illum molestiae itaque harum perferendis veniam dolores laborum eos odit fugit eaque sunt nobis perspiciatis saepe ipsam qui et impedit dolores numquam molestiae voluptatem quod consequatur et rerum et minus ea distinctio non eaque ea aut illo qui voluptatibus beatae voluptatem a sapiente quo et dolores est nesciunt ut voluptas dignissimos quia praesentium.', '1', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('515', '5', 'Provident omnis illo facere facere qui eligendi.', 'Earum dicta recusandae omnis a vel amet voluptatibus consequatur eius ipsum animi non quo qui et fugiat assumenda similique magni magnam dignissimos cumque autem quos est omnis reprehenderit fugiat molestias deleniti ratione tempore ut accusamus rem tempora tempora odit fugiat natus nihil sit necessitatibus aut provident aut non architecto exercitationem accusamus quam minus tempora ut est error sit et sint voluptatibus reiciendis suscipit commodi dolores nihil commodi quia pariatur sint repellendus accusamus voluptatem autem aut commodi est quibusdam ratione hic eius consequuntur in nam quia dolor voluptatem voluptatem similique debitis at doloremque et mollitia qui officiis aut blanditiis eius maxime aut qui voluptatem ut itaque asperiores officia fugit omnis dolor laudantium unde est illum velit ipsa rerum consectetur dolorum debitis ut alias et consequatur itaque sint quos autem eum dolores consequatur iure at voluptatem beatae hic magnam laudantium nemo sit quibusdam corporis facilis est architecto ab maiores accusamus in nulla temporibus sed corrupti quo dolore reiciendis voluptas cum molestiae nemo ut nihil amet amet dolorem distinctio accusantium cum est voluptas possimus ipsa aliquid voluptas odit ut placeat minus provident sed nobis vero ut sed aspernatur dolores fugit ea doloremque voluptatem necessitatibus fugiat sed ad molestiae quisquam exercitationem et molestias et sunt illo sapiente est tempora molestiae error ratione.', '1', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('516', '5', 'Laborum sed assumenda facere officia quis omnis a.', 'Corporis omnis sed architecto voluptas omnis sint aliquid sapiente illo quasi libero tempore dicta dolor assumenda error tempora quas explicabo deserunt labore odio non amet qui et inventore illo quisquam illum iure sed minima sed tempore mollitia illo dignissimos totam aut sunt reiciendis rerum aut iusto officia ratione aut quo voluptatem veritatis et modi fugiat fugiat eos et possimus consequuntur minus cupiditate molestias unde aut placeat rerum beatae in vitae libero iusto sed magni vel harum dolor suscipit excepturi est tempore tempora sit dolorem ratione repellendus pariatur eos ex numquam sit ab rem et ut culpa et molestiae qui minima consequatur earum ipsam id rerum error praesentium sed pariatur molestiae eos qui quidem iusto dolor omnis explicabo libero harum suscipit ut sequi facilis a ut cupiditate nobis quis saepe fugiat et ipsum minus alias qui eveniet deserunt molestiae consequatur commodi modi harum distinctio id cum enim voluptatem aut eum unde veritatis sit maiores dolorum minima cum aliquid est autem est maiores maxime quae architecto est maxime aut maiores omnis ullam sint facilis dolor est aspernatur quam fugiat culpa delectus tenetur sequi quo nihil velit voluptate nam rem ea aut minima voluptate in totam quis vel culpa ea repellat ea non consequatur enim doloremque similique cupiditate iure dolor eum dolor repellat cumque inventore commodi magni nesciunt et doloremque rem adipisci est labore voluptates repellat excepturi tempore ut asperiores neque deserunt.', '0', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('517', '10', 'Soluta aperiam voluptas ullam ut eveniet dicta sint.', 'Consequatur tempore reprehenderit laborum ratione omnis quia laboriosam voluptas ut itaque officia quos placeat voluptas fuga dolore natus magni dignissimos quam sit maxime illum sunt hic quos qui minima aut natus dolores eius illo qui illo est voluptatem natus aut praesentium quae accusantium tempore et voluptatem officia nihil soluta voluptas debitis non voluptas possimus reprehenderit cupiditate occaecati porro in quia eum amet dolore non sunt repudiandae dolores accusantium perferendis et laboriosam et magni aut minima maxime dolorum laudantium minus velit deleniti porro deleniti placeat ea rerum enim aspernatur doloribus quibusdam quod et enim voluptas doloremque eos natus quaerat omnis sequi sed inventore accusamus provident harum repellat non voluptatibus voluptatem optio veniam dignissimos qui ex maxime cumque consequatur veritatis placeat iste provident quia quibusdam doloribus mollitia nisi facilis vero aut facere et esse quo voluptatem optio tempora autem voluptas ut commodi iusto amet sit soluta architecto eum nihil facere quia at dignissimos dolore aliquam accusantium nesciunt natus saepe rem qui velit ea ducimus cum recusandae aliquid libero voluptatem quod repellendus necessitatibus ipsa quo sed quod ipsum rerum quo et iste ducimus ducimus soluta autem vel repellendus sit quod eum quasi dignissimos accusamus aspernatur corporis omnis quia porro ut ut nemo nisi voluptatem reiciendis dignissimos rerum cupiditate.', '1', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('518', '10', 'Et dolores consequatur debitis facilis nihil.', 'Doloribus harum minus molestias porro eum non eveniet ut nam qui culpa dolor provident est dolorem velit corrupti odit praesentium veritatis sed aspernatur recusandae aut ut magnam eos vel eveniet natus provident totam dolor omnis voluptatem ipsam aut quisquam quaerat expedita nihil eligendi velit voluptatem et ipsam hic voluptatibus iste aliquid rerum explicabo soluta corrupti deserunt modi nulla iure labore eum et qui et consequatur aut natus dignissimos ad dicta aperiam soluta beatae eius modi enim blanditiis dolores beatae aut magnam alias ea doloremque quidem quia a aut odio asperiores et quis adipisci commodi incidunt praesentium molestias eaque dolorum aut assumenda provident sit illum repellendus voluptas et ipsa optio veniam omnis minus qui consequatur veniam molestiae pariatur aperiam enim sed molestias et sunt ipsum est velit vel quam rerum distinctio sint provident saepe odit maxime unde ut et earum magni delectus eum dolores facere quas exercitationem enim illo beatae et optio rerum dignissimos magni quia sed veritatis autem ducimus tenetur quaerat odit et cumque molestiae iste excepturi et consectetur debitis id et ab quia ut autem totam voluptas aut quia possimus pariatur et similique ratione ex consequatur doloremque maiores inventore sint similique nisi minima facere quod non nisi possimus illum incidunt quo ut tenetur assumenda ipsam laudantium eveniet et voluptatem dolores eos dolor debitis sunt omnis voluptatem nesciunt corrupti magni est voluptatibus molestiae autem et eos voluptatem iste autem neque quia autem temporibus distinctio impedit maiores vel ea magni et repellat illum corporis esse quis placeat ut eum et sapiente libero quidem quia velit reiciendis ab esse explicabo eum eveniet placeat eaque dignissimos ut repellendus mollitia quo a ad commodi et consequatur consequatur sit inventore beatae inventore esse omnis et hic rerum delectus volupt