INSERT INTO `course_news` VALUES ('519', '4', 'Non aliquid et qui tempore nisi.', 'Dicta minima quas ipsam doloribus nobis velit ratione ducimus quod quisquam dolor quae vel voluptas odio totam laboriosam fugiat unde magnam ullam illo nulla necessitatibus ea aut iste molestiae tenetur ut porro aut soluta quo vitae suscipit ipsam enim quia alias hic nostrum culpa corrupti aperiam minus placeat qui architecto ipsum maxime excepturi rem sed et neque sed ut eos nemo rem eaque recusandae quibusdam iste nobis doloremque illum magnam harum velit consequuntur error pariatur amet sint est omnis ipsa delectus enim rerum id deserunt sapiente ut voluptas corporis magni id iure ratione ut non molestiae officiis reiciendis ullam non sint ducimus nisi est sunt sit expedita assumenda et ea ut minus dicta quas in eum blanditiis ipsam quas similique consequuntur ea facere commodi qui nostrum aut et voluptatem tenetur nam et magni cum sed id atque ut non magni nihil velit ut ipsa quia consequatur ratione ad ducimus exercitationem iure in maiores maxime qui veniam et laboriosam blanditiis ea in dolore illo dolores ea officiis consequatur voluptatem suscipit omnis nesciunt eos maiores quia voluptatibus et atque eum ut quis porro ipsam est ullam eum ab omnis omnis omnis quia quia omnis ratione minus consequuntur doloribus alias beatae voluptas cupiditate animi id at nihil ratione mollitia at occaecati nam id animi dicta dignissimos facere est delectus dolorem ipsam sit consequuntur nulla rerum velit eveniet sequi distinctio incidunt culpa quasi perferendis dolor aut quo quidem numquam voluptatibus odit ab voluptate rerum voluptas repellendus debitis ut quo in reprehenderit tempora architecto et.', '0', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('520', '3', 'Et ipsum accusantium odit libero a architecto.', 'Ullam voluptatibus et quia animi sint et repellendus voluptas tempora unde error molestiae iste ut possimus vel ipsum commodi nisi aut sunt sequi eos voluptatem iure reprehenderit eligendi dolorem ipsum soluta rerum est ut deserunt rem impedit ea voluptatum molestias est ipsam voluptas incidunt consectetur molestiae nemo non laudantium pariatur minus accusamus eum odit reprehenderit sunt fugiat et eum vel et corrupti molestias quibusdam neque ut suscipit sit eligendi maiores omnis quia perferendis veniam sint excepturi voluptatem voluptatem minus recusandae rerum eum omnis officiis delectus autem iure perferendis eum est dolor error et et et dolor error sunt sunt qui sequi cum aut nam accusantium pariatur sed nam adipisci consequatur qui qui quia dolore facilis est et libero voluptatum nihil eveniet sapiente quis reprehenderit itaque soluta ducimus excepturi illum asperiores distinctio ullam sed rem pariatur labore optio autem numquam facilis tempora ut ut autem harum corporis velit consequatur et qui non iusto officia commodi earum nam quo quia modi dolorum temporibus asperiores repudiandae repudiandae illo ad reprehenderit tempore veniam quia ut incidunt natus temporibus ut porro aut vero sed odio voluptas eum odio repudiandae.', '1', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('521', '7', 'Laborum temporibus sunt unde quia fugit qui eius saepe.', 'Enim quae quo alias ipsa doloremque sequi sit ut ab aut nostrum eum quia pariatur voluptas voluptate veniam suscipit voluptatibus aliquid et repellendus in ullam repudiandae earum qui vitae ut autem deleniti est repellat beatae reiciendis recusandae velit eligendi ad itaque soluta quia et dicta consectetur tempore sapiente labore et labore quisquam voluptatem perferendis eos aut quo dolor a est deserunt exercitationem recusandae consectetur qui sunt sit iste voluptas ducimus minus saepe consequatur omnis et voluptas dolore voluptatum rerum aut illo laborum ad soluta repellat non qui rerum nisi vitae fugit sapiente officiis ipsam veritatis blanditiis sit officia possimus quibusdam ad voluptatem vel sed aut est veritatis eos eum numquam sunt quia magni ad asperiores natus magnam illo velit rem aut doloribus perspiciatis autem explicabo in quisquam ea voluptatem veritatis odit aut est aliquid et molestiae asperiores dignissimos voluptatem accusamus et aliquid fugiat quisquam cum culpa incidunt et et voluptatem veniam quasi accusantium est ut atque magni et provident sunt omnis fugit eius eos est qui ut tempora dolorum odio cupiditate voluptatem nostrum sit quidem ducimus dolores perspiciatis sed expedita itaque facere illum iste repellat vel officiis impedit consequuntur ut ratione vel dolores dolorem itaque tempora et repudiandae aut vero officiis nisi dolores aliquid natus vero qui nostrum voluptatem voluptate doloribus et quod blanditiis provident omnis quibusdam odio culpa ullam velit aut nihil recusandae voluptas vel rerum qui nisi animi sed sint quisquam assumenda neque ut sit dolore voluptates laboriosam dolores quas quas sequi dolor sed fugiat explicabo praesentium accusantium voluptatibus iste sunt magni tempora sint molestiae est facere doloremque pariatur beatae pariatur ad ut aut similique nesciunt minus blanditiis cum.', '1', '2017-05-02 22:59:14', '2017-05-02 22:59:14');
INSERT INTO `course_news` VALUES ('522', '6', 'Ut velit dicta eum ducimus.', 'Assumenda voluptas quos cupiditate non qui velit non ut corporis et harum ratione dolores ab officiis voluptatem accusantium quia enim odit eius id tempore quod dolorem minima inventore numquam et explicabo pariatur ullam qui sit sed cum repudiandae quis sunt officiis quidem omnis est neque odio rem deserunt sunt temporibus sunt vel nobis nobis sit quos quidem delectus sunt quasi cumque doloremque nulla hic et corporis quo velit sunt eveniet voluptas qui sed quia doloribus ad molestiae eligendi soluta ut accusamus eum veniam quasi facilis sit et animi dolorem ab recusandae hic facilis aut placeat dolor qui asperiores nisi saepe iure ut nesciunt recusandae qui dolorem natus optio repellendus et et numquam vero hic magni quae dolor ipsam possimus repudiandae enim sint omnis eos sequi amet et dolorum tempora odit nemo occaecati sint minima error et nihil impedit natus ut eos vel explicabo consequatur tempore dolore doloribus nobis placeat dolorum incidunt quidem dolorem voluptas cum et aut necessitatibus autem omnis ad deleniti a qui dolores perferendis quam aut natus doloremque nostrum nam perspiciatis saepe quos commodi nisi natus soluta ut officiis eaque ipsa est quis qui sit minus omnis illo id impedit animi laboriosam eum ut similique in quas labore amet voluptatem quam dolor qui suscipit iste asperiores rerum aut officiis ut quia atque molestiae quasi velit error asperiores illo voluptas quos ea voluptas perspiciatis iste aliquid sunt consequatur est et quo sed quae voluptatum nihil aperiam sed quis nulla impedit accusamus voluptatem repellendus a enim saepe qui et enim nostrum vel aut assumenda soluta quia quis ullam assumenda sunt labore alias sed quia esse autem consequatur tempore soluta ipsa odit perspiciatis nemo ut ad quidem vel temporibus aut eligendi totam id voluptatem a quo dicta porro perferendis qui autem qui quo consectetur et ut blanditiis qui ex cum consequuntur quod vel