INSERT INTO `course_news` VALUES ('523', '5', 'Voluptatem eligendi qui sed ad suscipit.', 'Voluptatem modi molestias aperiam id id magni totam eos consequatur cum aliquam ea consequuntur possimus et alias ut quibusdam voluptatem laboriosam alias facilis minima nam sequi culpa maxime repudiandae suscipit aut ut aspernatur libero placeat eum magni consequuntur odit aut molestias unde molestiae occaecati debitis omnis odio omnis non quam et error illo velit natus dolorem ullam necessitatibus voluptatem dolores voluptas fugiat quasi numquam expedita voluptatem deserunt nobis alias aspernatur consequuntur libero voluptate velit fuga dolor consequuntur ut ut voluptas tempora est a dolore nobis ad facilis aut cupiditate quidem nihil accusamus perferendis sit officia voluptatem omnis dignissimos perferendis omnis aliquid aliquam et magni aperiam autem et ab earum minus repudiandae omnis labore adipisci quae ea ea harum sapiente quam odit esse aut ea eligendi fuga repellendus ipsa et et quidem enim sit voluptas alias non dolore quia officiis et neque veniam molestiae quis aspernatur laborum perspiciatis qui fugiat consequuntur ad aut labore expedita et iure laudantium et non nihil nam consequatur ipsum et sapiente nesciunt eum exercitationem beatae in unde dicta dolorum porro tempore sed rerum explicabo maxime consequatur quod assumenda est quas amet architecto est cum doloremque hic in omnis blanditiis vero mollitia adipisci odio rerum voluptatem eius et et ullam vero deserunt ipsum minima nesciunt nam beatae quis repellat et et omnis aut nobis omnis assumenda velit dolor mollitia non distinctio quia autem impedit nam saepe amet vitae cum nobis minima magni saepe ab quo repudiandae quam hic quae maxime eum tempore sit laboriosam laboriosam delectus numquam voluptatum tenetur ut sed reprehenderit accusamus autem qui porro vel maxime voluptas consequuntur commodi vel dolorum laboriosam voluptatum qui ab aut aliquam cumque perspiciatis sint repudiandae dolor reiciendis explica