INSERT INTO `course_news` VALUES ('524', '4', 'Sit culpa nihil culpa culpa.', 'Aut distinctio et ducimus sunt dolores distinctio ea non quasi culpa fugit explicabo accusamus ea ut voluptatum neque id quaerat pariatur consequatur cumque modi molestias consectetur tenetur nemo qui vel ab culpa voluptas laborum esse ad laboriosam rem quod aut error ea rerum sit optio vel voluptate aut unde in praesentium ducimus necessitatibus et cum ipsam nihil pariatur repellat id ipsum amet repellat omnis corporis voluptatem earum id sit consequatur qui sapiente id totam autem voluptates architecto quia quas qui ea maxime qui veniam esse vero voluptates voluptatum sint repudiandae et qui eveniet deleniti facere blanditiis numquam nesciunt odit quas nihil rerum qui ut voluptatibus est magni harum suscipit iste animi velit dolore quas labore ut est excepturi amet sint labore commodi ducimus placeat natus ut sequi nesciunt quibusdam laboriosam deserunt aliquam aut at officia distinctio ea et ut quis quaerat aut optio dolorem dolorum et voluptatem nisi rerum corrupti debitis reprehenderit id dolorem aut enim sit laborum facilis aperiam qui mollitia facilis quia ut ea eaque consectetur velit molestiae sit ut tenetur nam ea eum harum fugit in vel quas nisi aliquid ex ipsa odio sint molestias repellendus fugit sit ut sint repellat beatae qui facere quis voluptas velit molestias ea rem architecto corrupti est hic explicabo nesciunt omnis ipsum voluptatum quia aperiam iste dolor sit vel dignissimos repellat accusantium illo eaque cum in fugiat eum sint maiores dolores fuga laudantium ullam et explicabo delectus dolores neque ullam asperiores non aut iste nihil ipsum sunt asperiores esse occaecati non et repudiandae sunt veritatis iste velit veniam qui rem consequatur qui asperiores nemo exercitationem ad possimus asperiores alias aut dicta officiis ratione aperiam illum laboriosam ea sunt minima est eos est nisi pariatur vitae consectetur recusandae voluptatibus aut hic rerum minus vitae tem