INSERT INTO `course_news` VALUES ('531', '5', 'Quibusdam unde minima sed totam autem id velit.', 'Fuga ex ut laboriosam blanditiis saepe voluptatem quasi delectus ducimus ab quidem officiis explicabo sed et ex et omnis dignissimos quia ut molestiae ab debitis vel explicabo sint in eveniet sint earum at quasi magnam et voluptas tempora ex similique voluptatem rerum inventore nam quidem aliquam modi quis in et dolorem nihil autem nam incidunt veniam pariatur nihil cupiditate autem sapiente et laboriosam voluptates dicta consequuntur pariatur voluptatibus quia recusandae itaque voluptatibus non soluta quam soluta minima libero adipisci iure accusantium molestias facere nihil aliquid ducimus earum eius est dignissimos ea dolorem qui molestiae et suscipit officia eius est autem eligendi harum consequatur id voluptatum voluptatem ut sit quis repellat sint veniam officia non odit commodi est qui voluptas ut iste in aspernatur modi atque enim repellat odio id non cumque eius laborum quia rerum vero laboriosam veritatis laudantium fugiat quis excepturi repudiandae laborum quo aut excepturi fuga earum sequi ipsam quis quidem dolores repellendus ab qui alias illo ut excepturi officia ratione soluta voluptates sit aliquam totam laboriosam et aut facilis illum quisquam tempora est maxime illum est deserunt consequatur nulla praesentium officia sit deserunt hic repellat repudiandae quia sapiente praesentium autem et quam quis dolorum velit repudiandae dolorem eos quia veniam labore rerum odit ratione dolor voluptatem inventore molestiae tempora mollitia tempore similique culpa repellat ut numquam eum voluptatem dolor accusamus sint sunt vero dicta neque nihil magni reprehenderit et voluptatem odit velit sit sunt perferendis autem consectetur et autem quae repellendus aut reiciendis ducimus omnis tempora quidem minus cumque architecto possimus voluptatem ullam non voluptas ipsa deserunt aut sed sed et magni aut sunt debitis aut qui unde consectetur corporis aut quia mollitia dolor