INSERT INTO `course_news` VALUES ('532', '8', 'Ut nam vero assumenda praesentium est odit.', 'Sunt cum non et numquam ea voluptas maiores recusandae neque reiciendis aut molestiae qui sit dolor et nihil qui officia vel porro nihil voluptatibus culpa porro officiis itaque qui mollitia placeat autem debitis quos veritatis ratione dignissimos iure possimus et dolorem voluptas impedit vitae unde esse est et suscipit odio ut nihil quo praesentium impedit harum illum laboriosam dolorem necessitatibus saepe omnis aut reiciendis provident accusantium saepe expedita ad sapiente temporibus quo exercitationem beatae et qui in quia quia aspernatur consequatur deleniti placeat quia sequi velit eaque totam beatae et doloremque nobis non sunt aperiam et est itaque quia qui ut tempora quia non at odio excepturi qui maiores quod laudantium rerum sint quis voluptatem illo debitis dolores blanditiis aut in eos aut dolor ut repellendus accusamus fugiat sunt accusamus recusandae eveniet molestiae et pariatur quia impedit voluptatibus voluptas est neque voluptatem adipisci fugit quibusdam omnis placeat velit ex accusamus cupiditate quia sit autem aut sint voluptatem quas ea neque iure dolorem ea ea aut dolores enim rerum pariatur esse dolorem fugiat earum eveniet sed quia sed facere voluptatem ut eaque voluptas in expedita reprehenderit est qui minima cumque soluta nihil aut ullam et nam non sunt nemo aspernatur deleniti et explicabo commodi voluptatem id suscipit harum et recusandae quibusdam sunt ut et enim in itaque harum iure et dolore repellat ut minus placeat quo atque placeat possimus est neque quis quia eaque laboriosam reprehenderit non sed ducimus dolorum voluptatem quis laboriosam velit alias fugiat rerum quibusdam omnis error optio repudiandae in suscipit corrupti sunt corrupti maiores aliquid iste saepe commodi ea voluptatibus totam sed cumque dicta pariatur repellendus nulla beatae velit voluptatem placeat non sint est praesentium quod consequatur natus dolorem ipsam id omn