INSERT INTO `course_news` VALUES ('533', '4', 'Officia voluptatem praesentium saepe mollitia.', 'Quis repellendus sapiente et ipsum et vero explicabo porro est eius incidunt tempora voluptatibus laborum nam eius sit est doloribus sed sit quia ut eligendi facilis possimus repellendus non qui illo qui sed magnam possimus animi accusantium reprehenderit cumque vel et optio nemo hic quia sit dolorem non exercitationem error illum possimus sed harum optio nobis fugit eius ut quia hic dolores quia cupiditate magni deserunt libero quia porro beatae in quod aut sunt quas et facilis et omnis veritatis voluptatum eos veniam modi beatae dolorem voluptate quod voluptate in facilis nesciunt aperiam voluptatem aut et aperiam itaque et id dolor adipisci quis assumenda aut odio molestias nihil qui eius voluptas et est et et aspernatur eos fugiat qui enim occaecati harum ut voluptatem accusantium est reprehenderit minus neque cupiditate eos dolorum quam provident doloribus rerum cupiditate iste et voluptas sit amet sit velit sit rerum illum earum sunt accusamus sunt itaque eaque consequatur quo ut et quidem exercitationem aut est esse ipsum et quos quod earum voluptatibus commodi deserunt quam ad nobis voluptate nulla tempore itaque quas eum omnis facere esse provident vel veniam similique qui consectetur dolores amet blanditiis molestiae voluptatem sequi consequuntur voluptatibus odit eum hic velit dicta dolorem dolore maxime unde atque accusantium corporis voluptate est non expedita eos ut hic ipsam numquam consequatur adipisci sed qui omnis quia et aut ut est consequatur doloremque qui nihil et a consequatur illo consectetur porro ullam recusandae nesciunt quod dolorem quidem nihil nihil consequatur animi quia iste cupiditate dolores dolores et consequatur aut eius quidem veritatis consequatur in amet natus necessitatibus et rem illum eos consectetur dolorem ut quis sint est quibusdam est minima earum optio officia omnis omnis vitae accusamus libero culpa aperiam incidunt natus amet repudiandae non fuga omnis omnis vero molestiae eum aut ex maxime eligendi velit dignissimos vitae beatae ut suscipit nulla illo et sunt molestiae ratione provident repudiandae incidunt et neque in non quia ratione non ut similique reiciendis perferendis rerum vel eum corrupti beatae corporis dignissimos occaecati sunt laborum officiis velit et quia nam et et voluptatem sed animi ut facilis dolorem nemo consectetur et numquam magnam illum et sapiente id qui nobis.', '0', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('534', '6', 'Sed minus voluptates odit rem quia nam hic.', 'Omnis illo consequuntur possimus maiores ea et hic et aspernatur nostrum corporis nihil architecto dolorem dolorum dolorem ut repellendus aut laudantium harum laborum omnis et placeat qui amet quaerat cum fugiat aut molestias eos laboriosam laudantium quae consequatur est odit eos sint quos atque ut explicabo asperiores modi alias reiciendis quos at nobis aperiam et delectus eaque inventore similique ut ipsa ut et maxime unde odio dolor quo neque quia repudiandae aliquid rerum repudiandae occaecati rerum quibusdam consequuntur est eos qui dolor sed ex quas et modi eos et labore qui nobis est ipsum dolorum corporis molestiae vel delectus eligendi praesentium fuga alias facilis dolores quis dignissimos quo illo fuga praesentium voluptas at optio earum sed sit aut neque facere repellendus at amet voluptates ducimus accusamus animi esse explicabo quia nulla dolor totam nam omnis deserunt quia provident aspernatur quibusdam exercitationem quia aliquid qui nisi modi corrupti eos ut quae quidem quia dicta odio et incidunt asperiores non cum occaecati voluptates dicta amet dolores rem consequatur numquam porro laboriosam commodi consequatur voluptas cum porro assumenda animi aut ab rerum molestiae repellendus ipsam quibusdam architecto qui officia ab laborum corporis at consequatur corrupti sit necessitatibus temporibus ut rerum asperiores aut.', '1', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('535', '7', 'Voluptatem molestias et fugiat quia voluptatem et.', 'Voluptas eum qui eligendi perspiciatis ipsum eos rem et autem nobis rerum totam quia sit quia maxime sequi inventore excepturi voluptas molestiae nihil enim autem praesentium facilis est est sint et ipsum cum ab quaerat nam qui quaerat eaque repudiandae deserunt consequatur nulla aliquid at molestiae et magni temporibus incidunt et et est doloremque quaerat corporis soluta ut molestiae velit porro repellendus quia asperiores commodi aut natus veniam saepe fugiat assumenda laborum deserunt et ut quod quas dolores aliquid optio quibusdam vel similique consequatur dolores voluptatem ut libero ut rerum quidem quia minus aspernatur quia nisi non et id accusantium itaque exercitationem reiciendis quisquam quibusdam quo qui illo excepturi quia quaerat et culpa fugit totam et et quam in autem cum id et consectetur fugit voluptatem neque dolores inventore aut similique occaecati ut dicta non quaerat dolore doloribus et impedit qui ipsa impedit officia praesentium velit voluptates assumenda animi voluptates recusandae sunt dolorum ea et dolor asperiores illo autem qui tenetur reprehenderit reiciendis voluptas voluptas et aut vero veritatis eos nam et qui qui optio mollitia quod quod deleniti placeat aperiam cum mollitia fugit sit voluptatem aut repellendus ratione est consequatur sunt ut ipsum voluptatem et omnis in inventore aliquam quo itaque nisi debitis non sapiente reprehenderit id et et sit dolores libero neque natus animi qui.', '0', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('536', '8', 'Velit totam aliquam quam et officiis.', 'Omnis fugiat expedita et aliquid aperiam est eum porro nihil quia id qui necessitatibus expedita aut illum error ducimus culpa possimus culpa eos repellendus adipisci ducimus enim laudantium aliquam repellat aut voluptas eaque et et quia aut quaerat culpa aut similique occaecati non sequi eos sint veniam voluptate accusamus commodi eligendi quasi error perspiciatis voluptatibus facilis quia voluptatum est non consequatur provident maxime et ut consequuntur quos ut distinctio occaecati velit velit possimus et dolor et illo eum perspiciatis quis ducimus itaque aut qui odio nobis sapiente dolores itaque voluptas amet perspiciatis non aut quis quo velit minus illo vitae ut maiores consequatur fuga et enim minus voluptatem ex atque quia ut veritatis rerum omnis debitis distinctio dolorem hic et omnis ut ad exercitationem facere veniam beatae eos omnis suscipit dolores quae ea cupiditate occaecati laboriosam voluptas nesciunt laborum et a maiores enim quaerat labore ut quas voluptas eligendi ipsam voluptatem aut sunt corrupti maxime est odit ullam voluptas tempora alias reprehenderit quis asperiores quo quis labore aut ratione ullam consequatur rerum commodi aut delectus dolores sed voluptate provident tempore et tempore quia sit quas sed possimus dolorem labore sit voluptatibus quia consequuntur laudantium accusantium quae voluptas tempora officia minima et error unde dicta veniam eos labore iure ut eaque animi numquam accusamus dolorum rerum hic inventore eaque reprehenderit cupiditate aut molestias autem voluptatem molestiae dolores est aut dolorum velit repellat qui expedita voluptatum expedita deserunt quo qui explicabo natus ut porro voluptatum cumque dolorem sed ullam minus aut minus ipsa dolor qui nostrum quod accusamus a ut iste nesciunt blanditiis voluptatibus quae repellat sit et repellendus nobis temporibus maxime autem quia et voluptatem voluptas fugiat et id quia et ut aliquam aliquid eius amet expedita qui iste voluptas placeat harum quo voluptas veritatis porro et corporis eligendi est deleniti iste quam nulla rerum qui et enim nihil ab quae maiores omnis rem culpa saepe iure sapiente nulla suscipit recusandae soluta labore.', '0', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('537', '1', 'Qui aut illo et dolorem perferendis.', 'Vero explicabo aut eos animi blanditiis dolor odit corrupti facilis qui sequi et error dolorem rerum doloremque voluptates sapiente exercitationem tenetur non est minus iste soluta placeat aut eius nisi est qui voluptatem quod quos sapiente sequi consequatur corporis odit totam quia adipisci necessitatibus sunt quasi et explicabo ea ullam eligendi sed facere rerum deserunt quia eos voluptatem tempore nihil vel aut facere non assumenda aut fugiat omnis distinctio nihil provident nam voluptatem voluptatem voluptatibus id aperiam iste assumenda accusantium amet aut sit qui et veniam hic unde veniam commodi magnam consequatur et sunt reprehenderit a et autem aut omnis libero esse repellat ea assumenda aut alias impedit quia rerum rerum enim sit impedit porro dolores delectus delectus doloremque aut neque voluptas ipsa ut quo sapiente esse commodi quia itaque quisquam est libero voluptas perspiciatis est deserunt ex aspernatur sit debitis facere sunt nostrum aut magni et nihil dolorum velit neque similique eum perferendis eligendi dolor repellat officia praesentium sapiente ut sit aspernatur et recusandae doloremque magni iste repellendus quis qui qui expedita eos dolor sunt ut aliquid tempora voluptas sed unde qui architecto deserunt aut sint modi qui porro est inventore ad blanditiis ab similique voluptatum et nulla eos consequatur accusamus veniam molestias impedit sapiente veritatis harum ipsa enim est rerum consectetur iure maxime voluptatem corporis suscipit ut qui dicta atque officia.', '0', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('538', '5', 'Laudantium a rem aspernatur quibusdam.', 'Unde aliquid esse sapiente labore ut suscipit possimus laboriosam et repudiandae architecto consequatur maxime quas quia qui tenetur cum nisi officiis sint distinctio quia dolores aut reiciendis eos error illum repudiandae animi voluptatum amet et culpa fugiat beatae hic laboriosam itaque sed sequi nulla accusantium quo consequatur nemo aut quae omnis necessitatibus et est consectetur molestias dicta qui eos voluptas nam in accusamus fuga voluptatem consequatur numquam quis illo enim explicabo quae sed quas voluptatem animi velit voluptatem corporis quaerat quia et voluptates sint et aliquid molestiae quia velit possimus quam quasi magnam corporis sit nam accusantium est et ipsum sed est animi voluptatem voluptate distinctio harum ea et et corrupti repellat quaerat perferendis saepe sequi esse itaque quis porro assumenda est reprehenderit atque aut ut ut ratione ipsam qui sed sed quos non adipisci nam ducimus doloribus rerum dolorem molestiae repellat debitis nihil molestiae minus accusamus similique molestiae recusandae porro perferendis repellendus et accusantium id quibusdam saepe blanditiis ut facere assumenda iusto voluptatem ex numquam voluptatem non sit voluptatum debitis quaerat ipsa consequatur eos ut quibusdam qui perspiciatis quo officia corporis dolorem et similique exercitationem ullam ducimus incidunt doloribus vitae et est fugiat sit assumenda temporibus eos enim autem sunt voluptatem explicabo aut dolores dolorem consequatur molestiae quisquam aut corrupti sit minus est maiores blanditiis dolores et molestias enim temporibus accusantium quod veniam ea rerum perspiciatis deleniti vero hic exercitationem perferendis omnis sequi deserunt maiores ut sit enim doloremque tenetur possimus excepturi minima consectetur laborum sit fugit autem ut deserunt est labore qui accusantium beatae non nihil quod numquam commodi occaecati.', '0', '2017-05-02 22:59:15', '2017-05-02 2