INSERT INTO `course_news` VALUES ('539', '2', 'Excepturi tempore enim minus sapiente rerum.', 'Dolor deserunt explicabo blanditiis dolores quia non eaque sunt delectus alias officia ab inventore minus distinctio molestias nesciunt exercitationem non sequi eum sunt eos ratione voluptatem unde perspiciatis placeat quaerat eos ea adipisci provident omnis ut temporibus minima quia earum atque qui voluptatem aperiam reprehenderit consequatur quo praesentium et laborum doloribus fugiat consequuntur sit qui possimus dolorem enim unde totam sunt ea est quas dolor aliquid corrupti dolores voluptate sit praesentium tenetur qui aut voluptas nulla in sed enim quibusdam repellendus consequatur quas omnis quae aliquid molestias eligendi eum hic pariatur iure et nesciunt qui voluptas corporis aut voluptas nostrum deleniti quia itaque alias dolorum est rerum repellat iure eos aut aut omnis dolor ducimus harum labore accusantium quisquam quod tempore molestias eveniet ut sit dolores placeat sed asperiores ut ipsa dignissimos eaque blanditiis voluptas repellendus mollitia architecto et itaque sit eveniet non a facere accusamus quo quasi fugiat in nesciunt illum laboriosam sit provident velit velit ipsum distinctio aut dicta voluptatem commodi vel est aperiam qui commodi laborum perspiciatis recusandae magnam numquam dolorem non et non aut omnis accusantium et minus qui sint enim soluta consequuntur sint officiis odio sed nisi reprehenderit temporibus ipsam laudantium consequatur rem perferendis similique et fugiat dicta facilis inventore quod voluptas accusamus blanditiis sit voluptatum voluptatum sint accusamus eius omnis aliquid vel nisi et mollitia facilis amet ut voluptatem ipsum et explicabo quis eveniet nam facilis porro saepe vitae vero adipisci omnis ea quia eos et reprehenderit hic fugiat eaque quaerat ut quibusdam quasi ex neque adipisci et mollitia ut est quibusdam quis earum in aut iure ab ut maiores ab possimus reiciendis autem officiis quia sapiente odio quae architecto quisquam debitis dolor beatae maxime non quia ex hic ipsum placeat ut libero voluptate numquam ducimus quibusdam sequi eligendi maiores repellendus nisi id beatae rerum laudantium omnis repellendus qui molestiae ut ut minus dolor accusamus perferendis sed dolor ab et pariatur nisi dolor accusantium veniam velit reiciendis repellat distinctio tempora occaecati quia voluptas ut explicabo ullam optio aperiam laborum harum at et nesciunt optio blanditiis aut accusantium animi repudiandae labore sed libero sunt aut facere voluptate in pariatur enim distinctio expedita est eos natus nobis tempore rerum iste vel tenetur ex voluptate facilis libero unde aut porro.', '1', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('540', '2', 'Dignissimos iure vel sit cupiditate repudiandae autem reprehenderit laborum.', 'Quod hic minus quia sed tempore porro accusamus cupiditate magni fugiat debitis rem mollitia dolorum dignissimos impedit aut consequuntur alias similique fugiat omnis molestiae veniam praesentium quas aspernatur quasi ipsa cumque ut sint est recusandae necessitatibus nemo et eum natus id et ea voluptatibus nesciunt iusto optio voluptas rem aut nesciunt voluptatem alias repellat maiores occaecati architecto rerum quia optio qui doloribus sed et debitis adipisci dolorem quaerat corrupti quas nobis qui reiciendis tempora veniam quos delectus veniam aperiam adipisci repudiandae aut enim necessitatibus et fugiat et quasi doloremque iusto est fugit rem veritatis reiciendis eligendi velit aspernatur itaque et illum aspernatur saepe et esse voluptatem dolores dolorem eos fugiat voluptatem commodi ipsum facere excepturi tenetur rerum et rerum nostrum enim velit minima optio accusamus voluptas autem qui dolorem et voluptatem illo esse laboriosam sequi ex velit fugiat beatae omnis quisquam nesciunt commodi ut qui et explicabo eaque est ad consequuntur dolores est iste qui aut illo quis non voluptate quia eum repudiandae vero ut explicabo accusamus ut aliquid consequatur quos deleniti commodi eius corrupti ut laborum quidem adipisci molestiae eum sunt aut velit vel deserunt molestias tempora dolorum labore quia ullam aliquam nam dolorem odit dolorum error est aut reiciendis voluptatibus tempora qui occaecati similique eius provident adipisci voluptatibus quibusdam est eligendi reiciendis et quis blanditiis molestiae maiores rem quam sequi et aliquid doloremque iure id quia adipisci omnis explicabo animi id quos repudiandae quia nulla fuga nobis consequatur voluptas quia mollitia dolor et distinctio eligendi quasi est mollitia illo et vero harum sed enim totam nobis vel aut hic est temporibus quo dolor eum tenetur veniam unde quaerat officiis deleniti nam quam reprehenderit qui sed labore veritatis dolore voluptate provident animi quam quidem voluptatem labore rerum voluptatem quia minima similique qui iure nam ut at est est et vero quaerat tempore cum et dolores dolores quae corrupti iure amet amet dignissimos nemo voluptatum ipsa sed eligendi iusto consequatur est ut modi reprehenderit qui aut quidem eos inventore expedita ab cum est unde nulla magni provident deleniti rerum voluptas quia est qui dolorem ipsam corporis beatae enim quam ad rem voluptate numquam laudantium qui fuga saepe quas autem non rerum veniam quo distinctio eum amet voluptatem vel labore ducimus quasi veniam quod vitae iste nulla magnam quae voluptate quod sit aperiam expedita non autem.', '1', '2017-05-02 22:59:15', '2017-05-02 22:59:15');
INSERT INTO `course_news` VALUES ('541', '9', 'Cumque debitis vel quis qui quaerat.', 'Blanditiis numquam et ullam rerum impedit esse odio ut harum mollitia aliquid delectus excepturi quis ullam aliquam ipsam rerum vero in est laborum fugit quis adipisci iure assumenda velit vero laboriosam minus numquam a et ipsa repellendus sit tempora veniam veniam qui soluta nobis voluptate reiciendis id consequatur voluptatum dolores dolor et repellat tempore qui dicta tempora dolores ut aut optio aut veniam quibusdam quae mollitia harum dolores reprehenderit quae earum quia aut repellendus nihil laborum quidem molestias nisi vel vero rerum ut dolorum in numquam autem consequuntur consequatur earum saepe eum doloremque quis magnam dicta et quia expedita possimus et pariatur quia quam et consequatur adipisci voluptates consectetur non perspiciatis sit nesciunt beatae dicta sit id ex corporis veniam explicabo voluptas officiis in repellendus ullam laboriosam aut illum animi quia nesciunt consequatur recusandae quisquam voluptatem quia recusandae dicta itaque aut quidem aut non sit non accusantium voluptates eligendi cupiditate ut incidunt sunt illo ut dolor vel veniam maxime nobis rerum libero laboriosam fugiat ex sed ipsum aspernatur explicabo enim dolorem deserunt perferendis impedit et et quidem cum iure minima ex hic repellat ipsum quibusdam voluptatem maiores qui aut tempore aut et nisi adipisci voluptatem non adipisci aut ex exercitationem dolores et molestias vel expedita ipsa ut consequatur qui aut praesentium rem accusantium pariatur accusamus in exercitationem quo ut voluptas dolor nisi beatae molestiae ab ut occaecati quaerat quam delectus quia cumque cum quia sit id est dolor saepe animi veniam consectetur minus quam impedit doloremque quibusdam quia laboriosam possimus facere vel laboriosam iure enim consequatur rerum et autem perspiciatis sit molestiae aperiam dolorum aut eos magni quaerat.', '1', '2017-05-02 22:59:16', '2017-05-02 22:59:16');
INSERT INTO `course_news` VALUES ('542', '4', 'Odio quidem accusantium et esse sequi voluptatem nemo saepe.', 'Quis dignissimos repudiandae officiis ipsam commodi ea quis sunt dolorem vero rerum error porro similique eius officiis repellendus sint necessitatibus asperiores ex quidem similique provident nesciunt repudiandae quia fugit nemo perspiciatis quis repellendus id rem aut aut nobis beatae nisi culpa ea beatae voluptas similique ut voluptatibus qui unde ducimus dolor asperiores aut tempora incidunt accusamus dicta consequatur dolorum dolorem facere voluptatibus ex dicta voluptate ipsum doloremque aperiam sit amet eveniet voluptates aut est et enim et est beatae voluptatum est nesciunt architecto quia odit dolores tempore ea architecto voluptas rem quia ut odit beatae vel amet voluptas ipsa est pariatur excepturi odit libero quo vitae ea impedit neque ratione accusamus quos aspernatur dolorem quae voluptate eligendi qui libero minima a sunt atque quam ducimus voluptate natus tenetur doloremque qui suscipit aut et voluptatibus soluta nesciunt earum autem dolorem exercitationem qui est dolores tempora atque at eum fugiat sed cupiditate cupiditate explicabo qui molestiae excepturi itaque similique voluptate temporibus aut animi voluptatem voluptatem dicta eos sint excepturi temporibus cupiditate animi explicabo voluptatem deleniti sequi omnis hic dignissimos harum aut eum eveniet sit libero occaecati maiores iure iure quo reiciendis id consequatur excepturi vero illum consequuntur ea repellendus eligendi in architecto ut dolorum eveniet occaecati quasi quo a quis id maxime perferendis deserunt eum libero nihil totam exercitationem quam sit dolorem sed dolores sapiente magnam minus nihil.', '1', '2017-05-02 22:59:16', '2017-05-02 22:59:16');
INSERT INTO `course_news` VALUES ('543', '5', 'Dolorum magnam libero numquam ea repellat.', 'Et accusantium consequatur et exercitationem ea ut fuga praesentium qui dolore a vero et possimus aut accusantium facere ea quia ea aut excepturi ut vitae et voluptatem nostrum commodi reprehenderit omnis assumenda odio dolorem omnis provident voluptatum est odit qui nihil natus unde qui quia ratione ipsum qui laboriosam id neque quo voluptates placeat quod voluptatem nihil dolorem corporis veritatis ad eius animi eveniet sed aut itaque eveniet consequuntur nostrum et illo iure voluptates occaecati aut nihil tenetur non autem neque iste accusamus repellat consequatur blanditiis nihil nihil aspernatur ipsum quaerat qui vel ut cumque iusto totam autem vel rerum et dolor omnis sed veniam facere at eos aut animi cumque qui facilis corporis excepturi veniam nisi rerum velit omnis laborum odio ut aut repudiandae quia voluptatum saepe vel in est a ratione eum occaecati iure natus voluptatem eligendi nemo quo suscipit dignissimos et ipsam quia similique mollitia omnis assumenda expedita quod quos animi voluptas enim nostrum nesciunt quas odit voluptas ipsam quia suscipit ipsum placeat excepturi aspernatur tempora dolore quia non ut tenetur excepturi corporis ex fugiat velit quod sit dolorem sequi eum eum nemo alias possimus aut ut nisi fugiat magni et accusantium tenetur amet et nesciunt iusto qui ab quia atque blanditiis perspiciatis ut quod et saepe qui ipsam ab et eius enim quod deleniti enim tenetur quia rerum iste aliquam commodi consequatur ipsam et nostrum repudiandae aut nemo dolorem deserunt provident repellendus qui voluptatem quis corporis qui exercitationem quia temporibus repellendus et itaque temporibus commodi sed quis earum illum quis fugiat ipsam nam nostrum accusamus veniam animi molestiae odio velit totam architecto in aut aut veritatis doloribus modi totam dolore enim exercitationem minus aut esse quaerat quo aliquam consequatur esse consequuntur tenetur quibusda