INSERT INTO `course_news` VALUES ('544', '3', 'Recusandae ea ratione id id ut dolor cupiditate.', 'Necessitatibus accusamus nemo minima magnam expedita tempore dolor ab libero consectetur voluptatem aut rem voluptas nihil alias nihil nam aut rerum possimus ipsam ad sed et amet enim sed corporis voluptas pariatur ipsum et labore veritatis fuga voluptas tempore architecto ipsum rerum fuga harum velit quas quia dolor dolorem totam fugiat repudiandae magni voluptatum excepturi id alias rerum aut beatae dolores quia deserunt dolore ut dolores in sequi occaecati corrupti dolor commodi consequatur omnis eos nemo sit totam voluptatum itaque unde aut ratione alias quisquam quia veniam quidem amet quae fuga dolores non sapiente sit ullam vero laudantium unde ab fugit ea qui incidunt consectetur aut quas voluptatem eos voluptas corrupti sit rerum facilis cupiditate quo quam ut qui dolor reprehenderit odio cumque id sed unde tenetur iste doloribus dolorum voluptatibus ipsa ipsum necessitatibus sed enim repellat magni quis eius molestias iusto ea autem modi eos id dolores incidunt qui eveniet velit dignissimos illum hic nihil sed cum ea dignissimos incidunt dignissimos rerum possimus eligendi rerum iste molestiae et accusamus aut qui aut sapiente a quaerat iusto unde reprehenderit commodi molestiae minus qui et est eligendi est ut qui velit rerum quaerat ducimus velit in labore dolorum sit sunt quae culpa delectus quibusdam illo sed eos suscipit sit magnam fugiat quo qui veniam doloribus placeat ducimus tempora sed nesciunt illo non accusamus consequatur repellat excepturi dolor consequatur velit molestiae accusantium atque velit molestias nobis dicta est veniam et eius delectus reprehenderit mollitia aut cum debitis neque nam nobis cupiditate aut et vero esse illo voluptate sit qui recusandae est a vero inventore sed vel quibusdam aut aut et id dolorum officia libero ea assumenda.', '1', '2017-05-02 22:59:16', '2017-05-02 22:59:16');
INSERT INTO `course_news` VALUES ('545', '2', 'Quo quaerat ipsa sed repellat aut.', 'Ut sit explicabo doloremque omnis maiores veniam enim similique dolores quam officiis neque tenetur natus dolorem rem qui et voluptatem voluptatem cupiditate cupiditate consequuntur molestiae est ratione eos eum est consequatur quasi facilis praesentium ducimus quia distinctio natus id consequuntur magni accusantium similique error quos placeat autem aut nulla possimus repellat non cumque impedit aut hic magni possimus est error hic minus quibusdam consectetur amet neque eos tempore dolore numquam provident dolor quis aut quis quo sunt maiores sit suscipit sint accusamus rerum natus corporis voluptatem nam ab facere eaque nemo voluptatem et mollitia eveniet nam provident dolorem nemo consectetur sed libero neque dolorum adipisci ut et delectus accusamus et est a ipsa officiis in ut nam fugiat aut voluptatibus et modi aut natus ullam cum ipsam consequatur quas ut modi eos omnis adipisci vero sapiente architecto exercitationem modi ratione alias sint ab nam sint laboriosam sequi dolore ullam sequi ullam repellat omnis vel dolores est quia aut nisi id dolores enim adipisci iste esse quia eveniet est porro inventore maxime vitae aut et soluta ipsam voluptas ut sed esse dolorem repellat et aut nihil debitis adipisci non omnis sed omnis nihil error accusamus asperiores quidem totam minus est minus ipsam culpa officia ut ut deleniti est iusto eum quia ad mollitia dolore aut ex fugiat consequatur dolorem quaerat laborum magnam consequatur reprehenderit et magnam nobis nesciunt earum quidem non tempore tempora voluptas quis sit.', '0', '2017-05-02 22:59:16', '2017-05-02 22:59:16');
INSERT INTO `course_news` VALUES ('546', '8', 'Aut assumenda repellendus adipisci necessitatibus aut reiciendis molestias alias.', 'Doloribus aut autem esse et dolor labore repellendus nisi a culpa similique atque placeat minima quo harum facere iure magni eos est minus nihil eligendi rem rerum mollitia nihil animi pariatur rerum iste hic nisi voluptas in laborum veritatis qui et est distinctio esse cum esse id eveniet non ipsam iste at labore eos minus sit eos non magni voluptatum autem sed dolores eum dicta distinctio eius iste animi molestiae facilis nemo officia tenetur tempora et qui a adipisci occaecati hic natus eos sit tempore atque molestias quo voluptatum laudantium aut placeat sed ut minima vel nihil maiores doloremque quibusdam pariatur excepturi iusto excepturi non tenetur mollitia accusamus quod exercitationem repellendus dolor voluptatibus facilis labore fugiat id voluptas rerum magni cupiditate inventore odio voluptate esse aut omnis cupiditate aliquid modi est qui explicabo accusamus et aliquid minima commodi consectetur quasi delectus amet iusto et aperiam ut sequi cum quam in provident sed delectus aut dolor fugiat distinctio harum eos provident sit labore doloremque eos harum unde maxime dicta vero sunt sed ex ut ut quam animi enim aliquam amet animi et iusto qui ea itaque sint iure qui voluptates sed voluptas et doloribus fuga quia iusto voluptatibus dolores velit facilis facilis voluptatum provident qui molestias asperiores enim voluptatum quo pariatur magni itaque doloribus vero et hic in dignissimos at placeat nostrum accusantium quia voluptatibus non rerum numquam veniam quam molestiae debitis vel facere est minima itaque est voluptas omnis voluptatem earum architecto esse quaerat dolor quo assumenda commodi aut quis ducimus quo aspernatur et laudantium quia iusto nihil et maiores quia quibusdam quae nisi hic illo ut et molestias enim consequuntur molestiae tempora est tempora soluta sequi repellendus saepe expedita harum nihil repudiandae e