INSERT INTO `course_news` VALUES ('547', '2', 'Cumque sunt tenetur sit nesciunt.', 'Non praesentium ducimus sed et qui culpa atque ea ut atque perferendis exercitationem quos quia occaecati illo error et consequatur voluptas deserunt sunt iusto et occaecati ea est expedita qui repellendus exercitationem sint voluptate nulla sint aliquid est et quidem architecto sed nihil eligendi omnis suscipit et in aut hic dolorem rerum sunt voluptas harum ut veritatis possimus consequatur esse eius eos natus ut odit architecto exercitationem velit ut facilis nesciunt quia tenetur et dolorem numquam nemo qui quo consequatur sit velit dolores ex in voluptates natus voluptatum rem voluptates rerum sit molestias aperiam voluptatibus eum aperiam qui sunt id consequuntur excepturi harum et reprehenderit nihil odit enim architecto architecto nemo quae a voluptatum eos ad qui cupiditate soluta autem qui assumenda et odit ut assumenda reprehenderit ipsam omnis quam et id eos a dolor consequuntur sint explicabo ut minima quis facere tenetur vero voluptas quam omnis dignissimos quo quaerat tempore quia temporibus expedita et nulla qui ratione eos ipsa perferendis officia dolorum provident est non aut necessitatibus alias maxime voluptatem voluptatum harum voluptas praesentium accusantium amet exercitationem et dolore illum aperiam est maxime laboriosam id quia animi labore eligendi ipsa quia quos atque blanditiis iusto laboriosam blanditiis dolore nihil et culpa est voluptatem similique voluptatibus voluptas placeat aut corrupti magni nihil atque molestias tempora odio velit ea est et reprehenderit ipsum eius ea unde consectetur ea sint esse sit sit eaque sint minima sint dolorum aspernatur doloremque sed ex qui qui eos qui vel explicabo ut doloremque pariatur assumenda numquam molestiae quae eum ratione molestiae aut corrupti ad explicabo quo ut quisquam excepturi unde beatae quia doloremque vel similique ab fuga ut pariatur velit magnam assumenda eum et qui rem sed et non exercitationem i