INSERT INTO `course_news` VALUES ('548', '1', 'Ut ut molestiae fugit commodi aut quia.', 'Est exercitationem ut soluta quo facere illo autem et odio esse amet asperiores incidunt libero blanditiis laboriosam consequatur dolore nesciunt ad consequatur est et id animi corrupti qui facere modi id ullam rerum qui sequi qui sit fugiat quod alias et consectetur est eligendi iure temporibus sunt in repellendus cum laboriosam saepe veniam animi laborum accusantium temporibus expedita consequatur voluptas odio ad amet voluptate voluptas vero officiis maiores officiis voluptas rerum ut qui temporibus rem animi et id atque similique repudiandae natus rerum vel fuga consequatur molestiae est commodi pariatur soluta ea pariatur magnam porro non delectus iusto eos quidem dolorem ea laudantium rem id itaque recusandae assumenda ipsam doloribus earum voluptatum laudantium voluptas expedita accusamus beatae quos nemo voluptas id odit aliquid dolorum aspernatur iste et et corporis voluptates autem error voluptatibus inventore asperiores deleniti quasi at dolores iure quisquam velit accusamus aut distinctio totam velit sit consectetur nihil atque libero explicabo cupiditate natus accusantium natus aut voluptas dignissimos inventore enim placeat sint fuga ut amet dicta assumenda voluptatibus iste doloribus excepturi voluptas et id molestiae non repellendus dolores et voluptatem eum dolor omnis doloribus numquam aut necessitatibus molestiae qui cum temporibus autem nulla quae aut voluptatibus molestiae illum tenetur qui ut hic dolor mollitia sapiente odio nihil ipsa cum minima voluptatum ad iste ducimus ab harum sunt et odit expedita et natus aut iure veniam in sapiente amet nihil error voluptas quam quia assumenda dignissimos rerum quis earum qui architecto reprehenderit aut velit ipsa molestiae ea provident minima iusto iure ut eligendi ut et ratione numquam qui ut enim earum quos aut placeat ducimus rem soluta adipisci voluptas eum quod voluptates dolores sunt ab debitis commodi sed 