INSERT INTO `course_news` VALUES ('549', '2', 'Molestiae aut fuga consectetur mollitia ut.', 'Quia ut sunt rem ducimus at tempore aut cupiditate tempore assumenda sit quia non praesentium ut accusamus quaerat quo sed molestiae magnam tempore iure magni odit id dignissimos expedita voluptatem quae voluptas eveniet voluptatum rem qui illum eaque cupiditate sunt placeat officiis odio totam sed cupiditate ducimus nulla saepe unde vel voluptatem harum dolores aliquid ex nobis perferendis esse quidem maiores qui qui quia molestias sed quia adipisci aut rerum dolor sit sunt sit rerum cumque id fuga esse necessitatibus expedita labore aliquid voluptatem doloremque ex quisquam voluptatem quae est sint distinctio eveniet recusandae veritatis dolorem nihil ea nisi nostrum minus debitis similique nobis animi deleniti soluta molestias omnis est aut sed libero nihil earum sint natus in magni voluptatem dolorem delectus et quae nesciunt quia voluptatem distinctio itaque velit illo eum ab fuga odio consequuntur nulla eos officia officia nisi voluptas velit nisi et earum asperiores occaecati dicta ipsam placeat autem rem facere est fugiat consequatur in voluptates nesciunt rerum possimus quo maiores sint voluptatem ab hic fuga excepturi sunt adipisci dolores eos recusandae velit nihil itaque nisi odit enim quidem exercitationem voluptatibus laborum voluptatem omnis eligendi ducimus est ullam dolore nostrum quia ut quod veniam dolorum consequuntur voluptate quasi enim a voluptas vero sunt at nemo eos ut aut adipisci eos odit exercitationem enim debitis enim cupiditate non omnis ut quo alias quia dicta repellendus iste mollitia assumenda architecto eos sapiente quis est id accusamus nihil ducimus aliquam ut dolores in id unde hic omnis optio quo eos omnis sed blanditiis omnis commodi nesciunt doloribus nihil voluptas numquam sit sapiente dolorem deleniti voluptates voluptatem officiis totam nemo inventore maiores eum quia sed commodi fugiat atque voluptates hic ut ducimus dolore reici