INSERT INTO `course_news` VALUES ('550', '6', 'Qui fugiat error ducimus et.', 'Accusantium possimus animi velit quis illum quis neque nihil porro temporibus quo quia odit minus praesentium voluptate veritatis voluptatem sequi aliquid placeat animi quasi et vitae sunt magnam voluptas sed quaerat eaque voluptates et temporibus quia velit qui corporis doloremque et occaecati saepe consequatur voluptas illo ea sint corporis ducimus et excepturi est quia et eius provident dicta dolores illo fugit ab sit deleniti maxime possimus vero sunt veritatis est perferendis aliquid assumenda nihil odit non quia soluta quo quia ut recusandae laudantium voluptatem sed recusandae laborum eligendi est quia eius mollitia quia perspiciatis ducimus illum voluptas impedit autem molestias occaecati laudantium quo et expedita nam iste optio odio rerum libero cum autem eum necessitatibus et ea unde est doloribus soluta ut numquam non et dolor enim amet error sed quaerat dolor et debitis deserunt sunt expedita consequatur magnam est sequi dolorem blanditiis qui totam error tenetur iure maiores occaecati et quos culpa qui inventore quam autem nihil doloremque eveniet ut quia excepturi ab sunt voluptatem quae provident et voluptatem non est assumenda consequatur sed atque impedit ratione repudiandae consequatur ut impedit officiis eligendi quis provident dolore veritatis ipsa itaque temporibus ratione amet ducimus iure qui quidem nesciunt inventore illum minima asperiores nemo iusto optio qui vel et quo id ut hic placeat debitis quia provident velit aspernatur eveniet in provident eum perferendis impedit ut id unde dolore porro quaerat a sapiente animi nihil voluptatem voluptatum rem aut saepe voluptatem et sint aut debitis facilis rerum deserunt aliquid nesciunt fugit asperiores et quod quisquam unde qui ratione assumenda et rerum qui et nam corporis et expedita perferendis at nemo deserunt illo dolor possimus aut doloremque vel qui neque voluptatem sit labore et neque aut dicta dolorum volupta