INSERT INTO `course_news` VALUES ('551', '5', 'Exercitationem deleniti neque vel non dolorem.', 'A omnis animi quaerat temporibus nihil accusantium et impedit quidem veniam veritatis nulla quo quae veniam et consectetur nulla quae voluptatibus debitis molestias est magni consequuntur consequatur perferendis ipsam a magnam et iure quia sed distinctio perspiciatis incidunt quibusdam excepturi non magnam porro omnis ut omnis dolores quia est aut vitae nesciunt deleniti esse animi occaecati fuga eveniet quaerat dignissimos dolorem aspernatur quas ullam earum alias et modi fugiat ut itaque dolorum quisquam neque ab consequatur qui laborum expedita et id atque et cum at illum temporibus iste ut eos iste perspiciatis molestias et eum tempore omnis aut corrupti dolorem aut enim hic harum cumque minus nemo veritatis aut fugit ut et facere facere adipisci quaerat quam voluptatem quod illo maiores corporis aliquid aut nisi fuga rerum omnis est dolorem distinctio fugit labore sint culpa accusantium consequatur eos ea architecto pariatur doloribus ullam tempora ratione ratione natus qui nulla aperiam et delectus aliquam ut id soluta deserunt non veniam commodi nihil numquam laudantium provident non neque aliquid quia ut incidunt cumque quia debitis in qui porro in ea optio dolorem illum qui quos aut veniam ut itaque voluptatem voluptas natus at aut ut facere facere ab repudiandae voluptatem enim voluptatem architecto distinctio omnis deleniti quo ullam consectetur sit velit sapiente non voluptatem doloremque labore aut commodi vero voluptatem et reiciendis tempora quaerat assumenda temporibus vel doloribus voluptate sunt quia ratione aut veniam quia autem error quas consequatur consequatur ea praesentium rem fugiat est et sed quia nisi distinctio eos labore eaque necessitatibus est autem omnis non voluptatem repellendus aperiam saepe quisquam deserunt consectetur vero beatae eaque sed impedit eveniet expedita dolorem expedita aut consectetur placeat qui deleniti commodi autem re