INSERT INTO `course_news` VALUES ('552', '2', 'Ipsa maiores accusamus nostrum minima et doloribus.', 'Eos optio fuga blanditiis reprehenderit labore quia et atque ut et voluptatem magni sunt alias eaque accusamus est earum voluptas accusamus doloremque saepe vitae nihil quas quia id vero ut officiis et voluptas odio et libero saepe asperiores eius deserunt et sint earum est laudantium sed optio dolor voluptatem corporis magni libero dignissimos animi aut laudantium cum voluptas quasi id quam debitis sit omnis velit illum non consectetur corporis ipsa quas est earum modi debitis error molestiae perspiciatis porro magnam quibusdam in voluptatem voluptas labore maxime illum blanditiis aliquid earum excepturi odit possimus impedit sed animi quasi ipsum incidunt ut ea magnam repudiandae voluptas harum corrupti quae quia iusto aperiam maxime odio quos eos error veniam et blanditiis omnis voluptatem non adipisci alias at explicabo facere est et omnis ut voluptas optio est aut aut ad deserunt cupiditate nihil in voluptate quae rem aut temporibus ipsum rem eum id facilis voluptas dolorem ut eum quia enim aperiam voluptatem rerum numquam qui vero veritatis est aut vel eius deleniti facere ut aut dolorum qui voluptatem ut ab odit laudantium modi accusamus eligendi temporibus natus fugiat quo est ex voluptas et tempore ullam explicabo explicabo expedita ea accusantium molestiae hic natus impedit quis tempora aut temporibus saepe qui autem deleniti odit eum sint amet et dolores tempore dignissimos aliquam soluta similique ducimus suscipit et natus itaque hic nulla qui totam qui aperiam suscipit delectus voluptatem dignissimos ipsa placeat quod aperiam quae esse molestiae dolore dignissimos qui nostrum ex deserunt explicabo ad corrupti aut dolorum nulla minus dolor minus et et officiis soluta quos ut inventore voluptatum non autem laborum aliquam quia voluptatibus fuga eos dicta autem id quis occaecati doloribus cumque aut enim nam esse cum neque sit voluptatem repellendus ea aut