INSERT INTO `course_news` VALUES ('553', '10', 'Suscipit porro ratione quibusdam velit.', 'Ratione aliquam itaque et voluptatibus neque delectus recusandae amet eos officia dolorem est velit suscipit accusamus rerum nostrum qui iure nisi et illo quisquam incidunt est natus reprehenderit aspernatur exercitationem sed eveniet iusto neque sint esse commodi repellat exercitationem et esse aut expedita et aut corporis nulla saepe officiis accusantium vitae dolorem ullam aspernatur suscipit facere dolores nobis tempore tempore sint nostrum est enim sint deserunt fuga totam iusto neque consequatur inventore blanditiis minima quas deleniti omnis quo laboriosam et possimus amet est eos iusto velit id autem et atque non illum voluptates sint sint sed nulla impedit debitis et qui consequatur aliquam ex est molestiae deleniti qui et voluptas quod dolorem aut soluta voluptas pariatur id nulla aut neque enim doloribus optio non officiis voluptas consectetur iure ex ab quae quasi aut aut est tenetur repellat molestiae explicabo in expedita ut deserunt voluptas fuga quo esse distinctio quo totam aspernatur assumenda rerum sapiente commodi asperiores eos pariatur vero vel sit omnis sint velit aperiam pariatur non et facilis dolorem quibusdam nisi ut earum eius deleniti occaecati voluptatem eum pariatur consequuntur dolore corrupti atque sint quidem perferendis a reiciendis est omnis impedit accusamus est ullam quibusdam facere enim et nihil adipisci et sit consequatur non consequatur quia harum in consequatur qui delectus voluptate aut cupiditate magnam et rem corporis dolore doloribus perspiciatis non possimus recusandae dolor consequatur neque nesciunt impedit consequatur voluptas laborum impedit quod quia tenetur et itaque nesciunt sed cupiditate qui ullam dolore eveniet fugiat est veritatis facere voluptatem laudantium deleniti aperiam enim debitis eum et tempora laudantium qui sed accusantium cupiditate vitae amet aliquam maxime voluptas reiciendis excepturi voluptatibus et omnis aspernatur et autem voluptate magni qui repudiandae reiciendis consectetur corrupti enim eveniet magnam illo porro optio alias ex eum velit accusamus iste rerum provident reprehenderit sequi id unde inventore quia error consequatur cum cum atque qui ab earum veritatis impedit et blanditiis corrupti adipisci magnam harum laboriosam ea dolor nihil molestias placeat ea autem non culpa ipsam voluptatem repudiandae omnis illo reiciendis eveniet fuga perspiciatis harum placeat magnam molestiae eos vitae placeat qui eos sit exercitationem quae vitae placeat et quidem natus laboriosam fugit odio ex et quis maiores excepturi voluptatem ut alias culpa aspernatur et illo non ut at quaerat incidunt cum at et voluptas odit molestiae.', '1', '2017-05-02 22:59:16', '2017-05-02 22:59:16');
INSERT INTO `course_news` VALUES ('554', '4', 'Amet aliquid reiciendis cum unde fugit est recusandae.', 'Quos vero doloribus soluta aut cum aut eius sit nesciunt sit est non sequi distinctio libero dolores possimus temporibus atque quae laudantium qui officiis fugit aliquam molestiae voluptatem at repellat saepe quia recusandae autem rerum itaque quo quia voluptas libero omnis aut saepe alias a esse commodi veritatis repellat provident et optio consequatur enim consequatur qui voluptatem eos sunt nobis eveniet magni velit et quia incidunt vero aut voluptatum dolorem eius dolorum repudiandae qui placeat quas asperiores voluptas occaecati sed rerum necessitatibus iusto dicta maiores maxime qui tenetur ut illum quo eum eos tempore ad pariatur nisi sit quasi explicabo sed ex veritatis quasi consequuntur officia nemo et molestias similique aut ad magnam labore distinctio officia dolorum molestiae natus laudantium et eligendi reiciendis libero qui omnis vero ut quo cumque magni modi voluptas libero sed cum eos labore est omnis magni amet non ipsum consequatur molestiae repudiandae commodi consequatur ab ea laudantium est fugit dolorem veritatis esse ut fugit accusamus id qui sit est sunt ad facere eos id impedit ut aliquam aut explicabo animi quo sed est voluptas eos quas animi veniam consectetur et quod fugiat sit quas delectus tempore atque tempora reiciendis incidunt eos nesciunt perferendis et error reprehenderit dolorem sed mollitia similique debitis quod cumque fugiat est provident quis iusto quaerat voluptates dolor sint repellat commodi inventore ut qui id qui alias fuga saepe vel maiores id nulla aliquid accusamus laborum quidem accusantium consequatur voluptate occaecati et autem doloremque voluptatem sint et consequuntur aliquam est quia dolorem reiciendis dignissimos veritatis porro illo molestiae in omnis ipsa nemo quia voluptas consequatur veniam quibusdam quam consequatur eveniet labore cupiditate consectetur minus accusamus voluptatum at et et ullam nemo a