INSERT INTO `course_news` VALUES ('555', '4', 'Accusamus voluptatem aut laudantium et magni nihil fugiat.', 'Libero omnis explicabo eum nisi incidunt harum aut sit architecto accusantium aut quidem vitae vero omnis molestiae voluptatem exercitationem corrupti totam ut maxime culpa ea omnis dignissimos voluptatem fuga maiores modi inventore ex vel est saepe molestiae itaque et doloribus quam laborum est recusandae sit soluta illum ut tempore ea voluptatem et veritatis ad molestiae quos et natus eligendi facilis repellendus magni et quasi neque eius fugiat fuga similique eaque minus quis rem provident odio sed magnam sed eligendi eos et aliquid id et maxime dolorem ex repellat velit rerum quia similique earum maiores quo at ducimus nesciunt aspernatur aut minima nesciunt ullam quam voluptatem cumque rerum voluptas voluptas a dolore consequatur at autem tempora minima ea adipisci optio autem voluptas ab praesentium quisquam id accusamus eaque nam unde quidem consectetur quisquam atque id doloribus minima autem et omnis aut iusto laudantium expedita porro rerum perspiciatis quibusdam tempora ut quasi enim qui nemo nulla asperiores delectus dignissimos dolorem est ex harum quae et dolor et deserunt ea eum sed ea quis ullam aspernatur ut sit assumenda voluptas provident eum quia in rerum harum nisi similique ipsum ea fugit velit a ipsam iure provident rerum veniam rem sit nihil a nihil sint repudiandae.', '0', '2017-05-02 22:59:16', '2017-05-02 22:59:16');
INSERT INTO `course_news` VALUES ('556', '7', 'Tenetur est veniam sint quis.', 'Magni veniam voluptatem quae repellendus rerum quisquam deserunt omnis dolorem est repudiandae nobis qui et aut et voluptatem dolorem labore aut et labore ut ipsum voluptates accusantium debitis voluptatem accusamus atque aperiam praesentium excepturi sit quam reprehenderit totam quae dolores quaerat officia ex provident neque tempore doloremque natus fuga minus mollitia explicabo et assumenda eos est aut similique alias ea quasi itaque at fugiat accusantium id sequi dolor esse enim est quas et omnis deserunt et non earum ea labore nihil beatae iure nesciunt suscipit dolor deserunt ipsam perspiciatis et quo est rerum cumque sed et iste sed modi ab distinctio tenetur quam accusantium aperiam facilis omnis aut officiis sit aperiam praesentium qui ipsam voluptas quia placeat et facere neque enim modi aspernatur repudiandae reiciendis consequuntur aperiam quod ea nihil ut eos tenetur sunt ut possimus earum asperiores asperiores eligendi quis sint voluptatem consequatur nemo vitae quod veniam consequuntur est voluptatem incidunt aut doloremque pariatur adipisci est omnis saepe vel sint consequatur consectetur omnis ea nihil quo vel voluptates commodi explicabo officiis quia laborum suscipit molestiae cum corporis tenetur et sed id veritatis iste vitae ea consequatur est id et aut sed officiis et dolorem porro omnis voluptatem hic accusantium cum eius natus praesentium magnam omnis architecto corrupti repellat esse harum distinctio sint dolores est non voluptate beatae voluptates voluptatum et quia dolorem quis dolore distinctio provident culpa similique ipsam et dolorem laborum et repellat occaecati qui ea doloribus in nobis magni facere cupiditate eius est sint eligendi in animi rerum earum voluptatem vero recusandae id nisi qui cum nostrum aut dolore quia quia ducimus debitis omnis doloribus asperiores ipsum rerum quas molestias voluptatem consequuntur laudantium qui et molestiae qui repudi