INSERT INTO `course_news` VALUES ('557', '10', 'Quis ducimus et vero voluptatibus sunt veniam repellendus.', 'Ea consequatur numquam dolores aliquam eum temporibus est voluptas saepe adipisci sequi voluptas nisi qui harum dignissimos sint omnis amet deleniti architecto dolor quisquam ab odio ea eius recusandae modi saepe corrupti tempora tenetur aliquam aut praesentium accusamus adipisci necessitatibus qui ut voluptas reprehenderit natus consectetur dolore et voluptas quisquam qui molestias quia praesentium exercitationem quos maiores cumque laboriosam deserunt nam doloribus omnis saepe et qui nisi et dolores dolor laboriosam in autem veritatis delectus officia deserunt aut provident doloribus accusamus alias assumenda beatae inventore id aut provident voluptas cum ipsum qui occaecati perspiciatis tenetur ut dolor corporis et quam aperiam accusantium ea sint omnis atque architecto nihil repellat at quae ut ut nihil reprehenderit sit fugit nesciunt aut fuga sint consequatur cupiditate enim corrupti veniam neque dolores possimus est animi molestias similique alias qui sed qui totam occaecati illum repellat officiis totam quis velit nam quo voluptatum est aut architecto odio amet et aut illum earum illum quo et sit veniam ullam reprehenderit rerum magni ducimus quia dolorum autem molestias facilis velit voluptas qui optio molestias est dolor facere eius sint non voluptatem veritatis placeat est et accusamus distinctio in qui fugiat eaque labore omnis adipisci et quaerat totam itaque quo porro neque et consequuntur nam placeat expedita officia debitis rerum qui in expedita ipsum aut itaque et velit quos ut modi omnis magni hic quia vitae sunt quia et sint sed atque modi quod dolores laudantium dolore placeat in incidunt minus nam rerum deserunt similique dolorem incidunt repellat eaque eos veritatis labore id itaque earum est aut quos ut cum dicta officia explicabo autem molestias aperiam illum aperiam illum dolorem quis id porro commodi quis sed eaque qui ut dicta sit 