INSERT INTO `course_news` VALUES ('558', '7', 'Quisquam dolores placeat accusantium et excepturi.', 'Perspiciatis sapiente officia ut incidunt voluptatibus deleniti culpa sequi dolores delectus facere aspernatur repellendus incidunt aliquam enim ipsam eum quidem vero dolorem distinctio quasi voluptate est ratione aut non quas eveniet qui architecto recusandae cumque recusandae quam ipsa ducimus quidem aut dolorem eos laborum cumque deleniti est dolorum facere eos officia amet voluptas eum similique nesciunt iure qui quasi esse id et similique aspernatur officiis voluptas natus ducimus amet excepturi culpa aut quos rem aut temporibus sint sapiente voluptate fugit veritatis explicabo pariatur magnam accusamus in illum sed libero iste velit deleniti ad saepe debitis quia similique veniam incidunt ut voluptatem minus eveniet maiores in cupiditate reiciendis possimus porro praesentium asperiores tenetur ex numquam nisi quia cumque voluptas labore repellendus perspiciatis aut numquam laudantium similique deserunt nihil vel dolore architecto sunt aliquam at rerum quam voluptas repellat tenetur nihil non quia sunt porro magni dolores eveniet dolores rerum animi ducimus autem qui quam quasi cumque voluptatem aut rerum vel vitae quam nobis cum et eaque et non culpa sed vitae officia quia soluta quis iure sit sit dignissimos rem ea ipsum eum quas ratione ipsum voluptas hic officia veniam error numquam qui eveniet quae voluptas vel possimus eos doloribus distinctio eaque consequuntur consectetur nam voluptas ut et pariatur ab eos repellat accusamus quibusdam voluptatibus rerum reiciendis laudantium aut doloribus sapiente aut et assumenda aperiam enim iste qui quis aut maiores facere laborum dolores nam aut consequuntur labore adipisci corrupti fugiat et id omnis sapiente nihil alias assumenda consequatur voluptatem accusamus autem sint commodi accusantium amet vel quis sunt voluptatem assumenda assumenda cupiditate sed praesentium cumque praesentium omnis culpa soluta id qui es