INSERT INTO `course_news` VALUES ('559', '9', 'Temporibus exercitationem amet dolores ut sit animi in.', 'Sunt occaecati possimus recusandae voluptates consequatur odio mollitia a quisquam accusamus quis autem voluptatem aut at ut laborum dicta nam dicta suscipit fugiat quia qui velit vel eveniet ipsam rerum deleniti deleniti recusandae recusandae tempore animi ut mollitia nihil nihil doloribus ea dolor similique asperiores nihil ut qui veniam a eius corrupti possimus architecto aspernatur doloremque voluptatem distinctio quam aut sit voluptatem amet delectus laudantium aut veritatis odio est occaecati et est qui rerum mollitia corporis dolores sapiente temporibus beatae praesentium velit adipisci iure consequatur et quae est quas in aut sed dolorem praesentium odio repellat necessitatibus sit expedita repudiandae iure neque qui eaque facilis quasi itaque corporis voluptas saepe est dolorem occaecati soluta possimus eaque amet enim corrupti placeat laudantium iure eius consequatur ipsum sapiente occaecati ea soluta provident ipsum impedit explicabo est delectus tempora esse voluptas blanditiis debitis minima perferendis quasi ducimus tenetur ea eos blanditiis dolores beatae illo esse sed fugit necessitatibus facilis vero omnis distinctio hic et voluptas quasi sunt voluptatibus libero repellendus asperiores eaque veritatis molestiae earum quas labore doloribus porro et eius quod libero voluptatem est reprehenderit pariatur ratione quibusdam beatae praesentium qui inventore ea est eius assumenda vel veniam est repellendus vel corporis dignissimos aut reprehenderit qui quod aut iste eius commodi ab quia esse doloremque recusandae aut corporis autem est nisi placeat quaerat quod temporibus voluptas enim est libero harum fugit quasi velit sit sint quis repellendus et et sed est consequatur sed ullam alias excepturi modi autem nobis autem consequatur rem repellat qui expedita est omnis natus asperiores nostrum ipsam reprehenderit atque nesciunt at sunt et autem ut quidem dolorem dolorem quam aperiam qui placeat tenetur aut esse ipsam veritatis rerum nulla vel tempora velit impedit et eos voluptas quae expedita est dolores et in possimus ipsa fugiat harum minima voluptates voluptatem iure voluptas vero laudantium veritatis debitis sed maiores dicta voluptatem blanditiis voluptas error id asperiores architecto nobis est quia delectus magnam ad rerum perferendis cumque omnis distinctio enim sint recusandae quod vitae recusandae nihil unde labore asperiores id corrupti id optio id qui soluta cumque impedit qui iusto deleniti veniam rerum ab quo rerum voluptatem expedita fugiat aut nemo fuga qui delectus libero ipsam iusto ut vitae sequi dolores corporis omnis adipisci excepturi labore labore omnis ut corporis unde sit sit non quidem odit.', '0', '2017-05-02 22:59:17', '2017-05-02 22:59:17');
INSERT INTO `course_news` VALUES ('560', '2', 'Deserunt rem illo harum voluptatem.', 'Libero quas qui quas ea consequatur est qui ipsam omnis quam error necessitatibus facilis distinctio quo non commodi voluptatem ut a officia dolorem fuga aut ullam inventore at dolorum enim officiis dolorum ut libero eum magnam quaerat iusto autem nisi praesentium sint et similique nam laborum vel tempora consequatur in vel excepturi deserunt laudantium ut repellat qui vel iure harum sunt animi est accusantium tenetur inventore accusantium sed saepe maiores eaque cupiditate voluptate facere reiciendis odit mollitia et qui quae animi sint eum deleniti non dolorem est similique quia nam cumque perspiciatis qui culpa eligendi ab soluta quia omnis fugiat nam perferendis numquam officia aliquam et eius et magni mollitia eos magnam nostrum minus aliquam repellendus aut facilis dolorum voluptatum quia et tenetur reprehenderit et aut modi molestiae assumenda enim amet sint commodi laborum optio excepturi placeat necessitatibus repellat et pariatur voluptatem id asperiores animi sequi ad facilis dolor id dolore similique pariatur et earum reiciendis rem sed tempora totam ipsa eius corrupti qui deserunt quasi at ut eos sit deserunt repellat delectus maxime alias voluptate odio laborum itaque temporibus autem hic et qui error ea quisquam sint et magnam in unde dolorum pariatur sapiente quo consequatur deserunt molestias placeat perspiciatis neque corrupti et sint ut illo rerum qui consectetur sit et molestias placeat et dicta distinctio odit sed consequatur quisquam vel amet dolores est labore nam ab tempore natus perspiciatis voluptatem enim ea ut vel autem aut dolore deserunt ut consectetur rerum provident et qui laboriosam modi quos et quia autem ipsam eos ab aliquam quibusdam autem corrupti enim ea sit ut id quo doloribus repellat animi consequatur placeat explicabo.', '1', '2017-05-02 22:59:17', '2017-05-02 22:59:17');
INSERT INTO `course_news` VALUES ('561', '7', 'Est numquam a necessitatibus aperiam veniam.', 'Accusamus repellat omnis cum maiores et nemo laboriosam aut molestias dolores modi officiis libero autem expedita perspiciatis ullam culpa dignissimos voluptatem repudiandae sint ipsam commodi quos non sed consequatur qui et quisquam aut repellat sint occaecati dicta totam ut qui sit et corrupti sint omnis voluptatibus deserunt consectetur eaque odio dolorem mollitia voluptas esse ducimus necessitatibus fuga delectus ut nihil accusantium reiciendis fugiat expedita ipsum labore voluptatem aut velit illum assumenda iste voluptatibus sed et numquam dolor consequuntur aliquam ea aliquid aliquid cupiditate delectus vero ad delectus aperiam asperiores impedit sit dolorum eum reprehenderit cum fuga sequi ut maxime inventore molestiae labore soluta facere qui iusto qui et quaerat fuga est aliquam alias repellendus quisquam facilis recusandae quo odio non dolores autem omnis et qui voluptates occaecati facere sed quas perspiciatis et possimus quam sint nesciunt ducimus molestiae natus voluptatem mollitia qui sunt voluptatem sed voluptatem eum ut dolore eos ipsum est dolor quis quia rerum ut aut blanditiis tempora quos saepe quia illum qui reprehenderit enim voluptatibus voluptas cum sit debitis vero quibusdam quod sunt molestiae harum vel quibusdam magnam omnis nihil itaque nostrum consequatur sapiente odit ea facere culpa illum dolorum cumque autem voluptates sunt consequatur ipsum repudiandae suscipit magni quasi rerum id corporis iusto et porro corrupti facere qui rerum aut sed iste nihil beatae nihil et esse sit et sequi voluptas et culpa sit aut rerum voluptate distinctio et ullam vero molestiae numquam enim qui et et omnis repellat vero qui fugit amet beatae omnis rerum culpa animi non rerum non vel aut ratione ut ducimus voluptas et voluptatem quidem optio quo illum voluptate at aut sint sit in reiciendis voluptatibus natus similique quisquam incidunt voluptatibus consequatur quibusdam nesciunt et iusto consequatur doloribus unde molestias at tempora aut qui deleniti sed non corrupti cum quia provident itaque veritatis sint amet error expedita tempora unde nihil amet similique dolores quibusdam tempora unde dignissimos.', '1', '2017-05-02 22:59:17', '2017-05-02 22:59:17');
INSERT INTO `course_news` VALUES ('562', '5', 'Porro vitae reprehenderit aut quae qui quam deserunt repellendus.', 'Assumenda assumenda earum corporis iste laudantium esse est alias ipsa officiis provident voluptatem illum et iusto ut autem inventore quidem rem molestiae officiis molestias autem expedita hic tempora cumque et inventore libero autem animi et explicabo sed quisquam vel veritatis modi reprehenderit alias cupiditate ea autem in explicabo ut assumenda quis distinctio dignissimos in pariatur placeat quisquam enim sed officia temporibus dignissimos impedit qui odit ut dolores perspiciatis nesciunt aut sit aut est eligendi blanditiis tenetur eos exercitationem veniam voluptas deserunt nemo voluptas repellat optio rerum atque nemo animi itaque atque aliquam placeat voluptatem provident sit sunt necessitatibus accusantium amet officiis dolores ea molestias consequuntur temporibus dolores officiis eligendi ut eius sed molestiae sunt laudantium iste labore est et nostrum provident quia suscipit esse recusandae nam nulla rerum eveniet voluptate qui distinctio ipsam veritatis corrupti debitis ut dolor rerum nisi sed et accusantium officiis recusandae rerum ex architecto sit aspernatur corporis asperiores dolores et porro libero quia molestiae dolorem velit delectus voluptatem dolor id vel quibusdam est aut officia esse provident modi voluptate laborum eligendi nihil vel odio non itaque qui est dignissimos et et natus molestiae eum blanditiis eos fugiat occaecati ab magni occaecati ut et aspernatur consectetur cupiditate porro sed et aspernatur doloribus hic esse quasi voluptas aut eum excepturi corporis itaque enim earum est ut numquam necessitatibus.', '0', '2017-05-02 22:59:17', '2017-05-02 22:59:17');
INSERT INTO `course_news` VALUES ('563', '2', 'Dolores eveniet laudantium vel et non unde tenetur.', 'Aut labore commodi minus quo sit iure expedita non perferendis non ipsam distinctio optio voluptatem voluptate eaque sed vitae enim cupiditate aliquid velit quia voluptates culpa rerum possimus sunt odio ullam inventore suscipit suscipit quam exercitationem nam quos voluptas nisi porro placeat accusantium aut omnis amet omnis cum distinctio consectetur numquam ex libero dignissimos vitae aperiam ipsum fugit quo voluptatibus explicabo amet quo omnis dolorem recusandae aut omnis quae illo occaecati cupiditate totam autem optio consequatur adipisci voluptatibus quia facere inventore labore consequatur omnis facilis aut molestias a iusto tenetur natus est sunt non voluptatem voluptatem minima quo dicta nobis nostrum qui minima vel et doloremque est quo consequatur non sit minus voluptatum non rerum fuga illo eaque dolor id at quaerat officia quo rerum recusandae odit autem tempore nihil iure ratione maxime eius eligendi quia omnis animi eum natus sit non veritatis odit facilis id corporis et iure ut reiciendis ut impedit quasi qui enim quos ipsum ex pariatur omnis sunt laudantium nisi voluptas in aut molestiae impedit dignissimos voluptatem vel expedita perspiciatis numquam perferendis officia maxime amet perspiciatis doloremque vel sequi fugiat nesciunt dolore similique quidem a dolor accusamus voluptates culpa similique cupiditate delectus asperiores accusantium fugiat rerum qui voluptate vel expedita temporibus et nihil deleniti repellat optio velit ab distinctio harum quis qui fuga repellendus laboriosam aut quibusdam totam modi illum vel error temporibus nesciunt maxime nulla dolores aspernatur molestiae repudiandae quidem assumenda est rerum nisi possimus ab fugiat ut perferendis et molestias nesciunt eaque dolores nemo quidem cupiditate ut aut nisi quibusdam est consectetur iusto accusamus sit eum cupiditate aut eius non amet quia dolore delectus iste minus voluptas modi numquam consequatur quam ipsum et in recusandae nesciunt libero aperiam praesentium fuga itaque quo ut tempora est est ipsa repellendus autem aliquam corrupti ex et dolor id omnis molestias eligendi modi minima eligendi nemo harum voluptates.', '0', '2017-05-02 22:59:17', '2017-05-02 22:59:17');
INSERT INTO `course_news` VALUES ('564', '2', 'Enim aliquid culpa velit repellat.', 'Perspiciatis delectus ut sint quam consequuntur natus impedit est non temporibus voluptatum deleniti dolore assumenda sunt quo qui sed nobis necessitatibus nisi blanditiis omnis maiores ex quis enim et aut explicabo quasi explicabo sunt aut veniam earum dolorem vero perferendis optio ut quia sit consectetur corrupti fugiat eaque ea eum adipisci quibusdam eos officia expedita perspiciatis fuga rerum ipsam molestiae eos unde perferendis maxime nobis ea assumenda et sed et delectus aut rem commodi distinctio voluptas et natus deserunt qui quas quas maxime occaecati tempore beatae optio doloribus quasi quae consequuntur at velit unde laudantium non aperiam voluptatem nesciunt tempore sint aut dolor facilis exercitationem provident reiciendis et ea expedita omnis sit culpa at possimus et animi eos libero ut distinctio voluptatibus quidem vitae hic laudantium non labore officiis ipsam fugiat aut magni quaerat fugit ut id natus cum optio non eum ipsum pariatur rerum blanditiis fuga sunt consectetur non et quia ab laudantium praesentium ea nam a aut voluptatem cumque id iure qui sed magni animi molestiae repellendus perferendis praesentium id commodi tenetur expedita sunt fugit dolorem dignissimos ut sed quidem unde quia nobis eius quaerat non in laboriosam omnis officiis rem sed facilis itaque quam maxime dolorum neque repellendus labore explicabo ratione voluptas quam quia ut vitae amet doloremque dolor corporis necessitatibus molestias hic iste quia quod illo cupiditate ex ut aut amet nulla porro quo nihil voluptatem enim non perspiciatis asperiores dicta et accusamus porro at quo voluptate quia eos exercitationem impedit exercitationem aut et doloribus quis explicabo sint atque a non quo nam reiciendis minima distinctio quasi eligendi et reprehenderit quibusdam illum dolores fugit magnam ullam sint voluptas similique totam aut et suscipit enim dolore a ipsum est omnis facilis cum evenie