INSERT INTO `course_news` VALUES ('565', '4', 'Et ratione velit sunt et facilis dolorem rerum.', 'Voluptatem aliquid excepturi debitis nesciunt adipisci magnam nemo dicta et atque impedit illo deserunt aut occaecati qui quam quo et doloremque nam eum velit et saepe velit accusantium fugit provident molestiae repudiandae et excepturi dolor placeat quis qui ipsum nostrum fugiat cupiditate ut vero quod dolore consequatur facilis optio nesciunt aliquam molestias asperiores natus quas vel dolor nobis odio error omnis eum veniam quis voluptates numquam neque voluptatibus adipisci aliquam omnis assumenda eos consequatur asperiores cum aliquam dolor sapiente nihil magnam quia repellat officiis illum praesentium quam quia ipsam soluta et culpa et quam consectetur et enim enim architecto ad quo molestias non qui quis et laudantium et consectetur minima qui error a sapiente possimus magnam rem in minima quidem occaecati quae fugiat nobis consequatur culpa nostrum perspiciatis consequatur voluptas reiciendis maiores eos harum ipsum a iusto magni rerum qui occaecati error dolorem molestiae necessitatibus corrupti rerum enim iste pariatur alias eligendi qui error fugiat eius sit sed et incidunt ratione corrupti perspiciatis et accusantium et voluptas temporibus nobis porro et doloribus maiores alias quia quia perspiciatis qui eos quia enim debitis a doloremque facilis quia pariatur voluptatibus est odit consequatur sed perspiciatis cum dolores sequi voluptatem debitis similique voluptatibus facilis temporibus quo ipsum tenetur debitis quod est commodi et culpa consectetur eveniet dignissimos.', '1', '2017-05-02 22:59:17', '2017-05-02 22:59:17');
INSERT INTO `course_news` VALUES ('566', '6', 'Autem earum corporis qui consectetur ratione temporibus.', 'Laudantium corrupti est veritatis est laudantium ex vero blanditiis neque neque saepe debitis hic voluptatem ut ut harum voluptas non assumenda autem quia ab mollitia illo saepe quis id quis molestiae perspiciatis vel adipisci odit consequuntur eum et nisi similique consequatur eos odio sint fugit sed velit et magni et culpa voluptas et ratione magni perspiciatis maxime odio at voluptatem maxime totam eius et est velit rerum ipsum facere iusto eligendi minima mollitia natus consequatur voluptatem expedita excepturi aliquam harum incidunt dolor est rerum facilis accusantium perspiciatis possimus quis amet maiores ipsam quod praesentium nam maxime a voluptatum a error qui nam temporibus mollitia et et earum dignissimos beatae et quia eveniet aut ut ut deleniti non qui suscipit inventore quaerat est esse et veniam aliquid consequatur est in aspernatur modi eos cum asperiores nobis incidunt enim aliquid labore aut et fuga dignissimos tempora dicta repudiandae quia dolor ea consequatur dolor reiciendis dolorem magni itaque nostrum excepturi in enim inventore optio laborum quae et optio explicabo voluptas sunt consequatur beatae et quis minus qui rem qui ipsam veniam vel voluptate maiores odio veniam dolorum et quo voluptatem voluptatum excepturi dolor consequatur libero sit libero a impedit debitis provident voluptate autem sit iste eum qui nulla inventore aut perspiciatis ea sapiente quo tempore labore velit minus dolores quibusdam eius facere sed ut sit placeat quia recusandae quidem aliquam nisi occaecati dignissimos omnis dolor amet ratione nesciunt quo omnis vel quo dicta consequuntur quaerat repellendus dolore pariatur accusantium sit quam officia laudantium quaerat rerum earum voluptas ab adipisci quisquam nostrum sed ad distinctio distinctio expedita id aliquid culpa veniam enim accusamus voluptatum atque aut voluptas vero ut et sunt.', '1', '2017-05-02 22:5