INSERT INTO `course_news` VALUES ('575', '2', 'Rerum occaecati quasi ut suscipit iure quisquam.', 'Aspernatur non nemo est voluptas fugit consequatur itaque qui sapiente dignissimos alias voluptatibus veritatis nulla voluptatibus voluptas ut culpa error sit sit magnam perferendis voluptatibus quo doloremque explicabo dicta temporibus qui voluptas consequuntur qui enim laudantium minus excepturi natus dicta consequuntur fugiat dolor quibusdam et quo optio doloremque voluptatem et sed illum excepturi iste aut eum quo totam optio voluptatum sit voluptates asperiores commodi nam non deserunt nulla tempore voluptatem odio a temporibus pariatur vitae quisquam dolorem expedita quod eaque necessitatibus ad minima voluptas asperiores nam iure rerum voluptatibus tempora aut quae voluptatem quas earum accusamus voluptas qui molestias optio ut voluptates quas quo enim incidunt voluptatibus architecto sit enim sint aliquid et ut ut sed cumque et voluptate eos qui voluptatibus officiis ullam voluptatibus vero magni voluptatem et et deserunt blanditiis sunt rerum est est libero officia excepturi aut fugiat aut hic ut quasi atque magni recusandae voluptatibus sit ad labore iusto rerum id autem mollitia debitis incidunt et aliquid in consequuntur doloribus ratione dicta dolor cum incidunt odio temporibus est asperiores nobis non occaecati eaque porro et voluptatum quo natus illum perferendis ea sed omnis voluptas beatae atque repudiandae iure iste ab iusto culpa.', '0', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
