INSERT INTO `course_news` VALUES ('577', '5', 'Iusto vero pariatur adipisci.', 'Minus at nihil libero quia est accusamus occaecati pariatur culpa cumque aut quod nesciunt esse similique ut eum perferendis quia tenetur iste culpa velit dolor sint quasi velit quia cupiditate maiores sit iure dolores omnis tempora enim quidem distinctio repudiandae qui nobis quae voluptatem suscipit reiciendis vel inventore voluptatibus officiis id dolore corporis iure quibusdam officia earum necessitatibus eum est velit rerum facilis veritatis voluptas dicta sunt facilis in facilis saepe cum vel odit ex nesciunt unde vel id necessitatibus ipsum enim dignissimos blanditiis non earum et hic sunt facilis quaerat iste voluptatem non reiciendis ratione alias ratione hic ipsam aperiam doloribus porro reiciendis quisquam explicabo rem illum qui quia aut velit veniam sequi odio commodi eum vero suscipit consequuntur recusandae consequatur perferendis in maiores temporibus perspiciatis id animi tempora commodi autem aliquam quas voluptatem amet sequi nihil est animi incidunt a error consequatur ut in sunt enim et earum voluptatibus tempora exercitationem mollitia corporis aliquid aut sunt aut dicta et voluptas nostrum atque molestiae et sint molestiae ut et odio exercitationem nihil ducimus placeat eaque doloribus ipsa doloribus repellat soluta quibusdam quidem neque ut amet et ipsa iure enim culpa ut quasi a iste tempore recusandae maiores consequatur voluptatem minima molestias a eum ea quaerat temporibus ut quae quod doloremque tenetur magnam modi omnis ut vel tenetur et non.', '1', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('578', '10', 'Omnis temporibus esse molestiae consequatur at.', 'Aliquid possimus omnis eum aliquid unde ut inventore eius placeat labore iste minus dolorem nihil non exercitationem ut et dolores aliquam molestiae quas sint provident enim corrupti odio dolores quia consequuntur perferendis est expedita eveniet nihil laudantium incidunt delectus a possimus est eveniet nostrum aliquam dolor alias nulla neque suscipit temporibus non eligendi quaerat quisquam quis asperiores aut quia eligendi quo eum illo consequatur placeat dignissimos dolorum nobis eos in mollitia neque soluta non officia atque voluptate consequatur at quis laborum odit dolore et reiciendis repudiandae sequi voluptatum nesciunt cumque voluptatem optio id et nostrum rerum nihil aut aut quod modi ducimus eos inventore nihil repellendus alias architecto nihil rerum dolores sint excepturi laborum commodi eum rerum eius sapiente modi est quo maxime modi est cum optio natus nobis sunt repellat ipsa eligendi inventore doloremque voluptatem quia reiciendis eos eos animi sit sed et numquam sint necessitatibus vel dolores velit rerum deserunt temporibus eveniet commodi voluptatem unde delectus eaque quidem deserunt architecto magnam iure et voluptatum impedit est ab velit voluptatem magni natus quis soluta aut quo alias ut et cupiditate omnis nulla veniam perspiciatis omnis nulla dolores quia et consequatur doloremque est aut maiores deserunt maiores quo qui repellat tenetur quia ducimus harum ut nihil architecto ea rem consequuntur nisi omnis tenetur voluptate fugiat veritatis et quo et minus consectetur blanditiis occaecati adipisci in ut dignissimos corrupti repellat itaque amet fuga voluptates corrupti doloribus eligendi veniam laborum beatae tempore soluta ut et ea placeat porro pariatur nemo quae accusantium omnis neque qui ut vel nemo quos qui qui ea occaecati qui et non aut dolores doloribus quis.', '1', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('579', '7', 'Enim eveniet molestias ut voluptatibus non reprehenderit doloremque tenetur.', 'Quo consectetur et nam aut natus minus rerum sint sed est voluptas quia quia eos in veniam veniam earum est exercitationem iusto sunt qui in fugiat quos error perferendis quia necessitatibus voluptas consequatur fuga possimus enim cum libero excepturi architecto consectetur in itaque et exercitationem facilis repellat ratione et laudantium ducimus asperiores ducimus est accusantium est fuga at voluptatem repudiandae illum maxime iusto et eos veritatis corrupti doloremque praesentium molestiae est aut fugiat maxime incidunt quas deleniti quis nisi sint alias aliquam nobis et est nam eum deleniti rerum saepe necessitatibus repellendus eos dicta voluptates ut quia quia reiciendis aperiam recusandae omnis consectetur alias et nihil aliquid dolores labore ab officiis consequatur pariatur omnis vel aliquam aut consequatur natus magni dolore eum mollitia error rerum omnis nobis nostrum aliquid nam accusantium repudiandae velit consequatur sed itaque est veniam laborum est in ab vero voluptas inventore hic quibusdam labore autem qui et porro placeat sequi earum iusto quia deleniti tenetur quae voluptas quam et nam veniam totam exercitationem explicabo nisi rerum iure impedit sint tempora totam aut quia consequatur asperiores ratione commodi reprehenderit aperiam voluptatem incidunt maiores rerum iure non quod dolorem molestias mollitia illo porro ipsam omnis assumenda repellat possimus incidunt ullam voluptatem accusantium excepturi quaerat in sequi dolorem provident eius corrupti perferendis perspiciatis consequatur quaerat at distinctio et alias soluta dolorum impedit fugit earum expedita aperiam quae illum iure quam magnam accusantium non ut vitae quo rem odit atque quo similique nemo quaerat quo quibusdam exercitationem nihil et sed et ut autem aliquid a totam ut eveniet exercitationem consequatur et eligendi sed et dolorem maxime eos in magni q