INSERT INTO `course_news` VALUES ('580', '5', 'Dignissimos mollitia qui maxime neque facere ex ex.', 'Tempore repellat suscipit voluptas maiores perferendis natus dolore sed omnis mollitia amet beatae voluptas in autem ratione non quod sit pariatur ab expedita voluptatem praesentium amet quae assumenda animi optio facilis nostrum exercitationem eum natus saepe neque ab perspiciatis alias deleniti quo ea similique qui quia tempora et dolores aut nesciunt velit ab sit rerum unde pariatur veniam et qui qui dicta et dolore laborum rerum alias qui enim debitis ullam illum delectus et nesciunt est nostrum cupiditate blanditiis qui hic facere omnis voluptatibus dolorum voluptas perferendis qui id eum iure earum quas quis quo eos laudantium ea ut veritatis labore autem ut commodi cum enim necessitatibus a quo quo aperiam in dolor officia enim et enim saepe amet a possimus in vel temporibus nobis quasi unde modi expedita sint placeat laboriosam blanditiis quam laborum et rem rerum quisquam est aut ipsa vel ut aut rerum corporis a tempora dolores fugiat ratione aliquam velit qui aut pariatur laudantium dolorem voluptatem et nesciunt voluptates et repellendus architecto ex pariatur et eaque voluptatum ipsam et ut numquam itaque sunt est voluptatem in velit officia sit ex magni in quasi et optio quasi dolore quia sequi voluptate blanditiis dicta assumenda illum sint pariatur maiores et perferendis sit ullam voluptates nobis animi consequatur fugit alias et deserunt ipsum ipsa delectus suscipit.', '0', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('581', '9', 'Possimus debitis sit mollitia atque vel dolores velit repellat.', 'Quia fugit excepturi debitis eius labore facilis necessitatibus et sit et exercitationem sint asperiores dolores dolores voluptates occaecati alias voluptas asperiores aut fugiat iusto magni iure non cupiditate eum similique rerum dolor consectetur voluptatem et eos dolorem aut quaerat corrupti non ut dignissimos aut et laboriosam ut quia fugiat nesciunt ut nam velit rerum ex perspiciatis modi reprehenderit sed eius ipsum laborum unde aut illo saepe in sed veniam consequatur et optio rem numquam rerum voluptatem sunt non dolores voluptate ea quaerat consequatur veritatis suscipit qui ab temporibus error minima consequuntur non illo et facere non omnis exercitationem velit soluta veritatis unde ducimus porro expedita non sit esse sequi modi laborum quam consequatur ut atque qui aperiam facilis corporis saepe sit tempore quos laborum fugiat dolorum recusandae minus est voluptatibus aut eum nihil dolores voluptas qui aut sit perferendis accusantium maxime id amet fugit dolorem est magnam sed adipisci pariatur aliquam doloremque autem sed assumenda asperiores ab harum sit tempore aut placeat placeat illum quia quos error rerum reprehenderit dolorem porro voluptatem ut non est laboriosam qui asperiores veritatis quos facilis corporis exercitationem libero non saepe eum dolor ducimus dolore quia non deserunt quam excepturi voluptas vitae necessitatibus qui recusandae repudiandae exercitationem est voluptatem maiores provident repellat et omnis recusandae fugiat ea iure velit molestiae aut aut aut est non sunt iusto est doloremque reprehenderit quisquam quia aliquam architecto similique autem non maiores ea vitae eligendi quaerat ea eveniet eius nobis repellat qui omnis velit ratione sint aut perferendis nostrum ut sequi vero rerum corrupti in repudiandae quas itaque voluptas facere sit enim aut sit expedita quaerat deleniti alias in voluptates magni amet sed itaque aliquid nobis totam praesentium id quo quae id ipsa culpa unde doloribus voluptas quis nulla exercitationem sed neque sapiente inventore numquam architecto et exercitationem minus et sequi id sed suscipit aut ut est minima hic aperiam quis quo alias voluptas voluptatem est aut delectus expedita ducimus quos nesciunt corrupti quisquam nihil quae assumenda sint ipsum qui voluptatem aliquam voluptas voluptates iste explicabo iure soluta voluptatum dolor qui architecto quis dolores ducimus enim totam rerum aut aperiam quae non autem cumque quod omnis ad laboriosam et in quia numquam laudantium similique quaerat consequatur dolore reiciendis consectetur voluptas rerum dolorum aut qui ducimus ratione molestias earum vero aspernatur quo possimus rerum a omnis quaerat nesciunt et commodi maiores doloremque est accusantium ut in ad dolor molestiae explicabo pariatur nihil mollitia.', '0', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('582', '1', 'Mollitia assumenda repellat accusantium blanditiis sed.', 'Et provident neque architecto excepturi id fuga tenetur sit culpa porro fugiat quidem qui nostrum et reiciendis nemo voluptas rerum eveniet non et ipsum est adipisci temporibus delectus autem exercitationem exercitationem maiores ut nihil aut minus mollitia optio nam et et ut debitis magni ut quam corrupti quo nemo cupiditate qui eveniet provident quasi suscipit qui non eligendi atque asperiores sint reiciendis tempora assumenda fugiat saepe incidunt quibusdam corrupti enim eaque quia aut sunt et nulla ipsum vel eos laudantium quidem id accusantium adipisci sapiente voluptatem tempore doloribus repudiandae voluptates impedit sed inventore impedit nobis magni et quam eum ratione animi voluptatem placeat dolorem ut quidem numquam assumenda optio sequi quis debitis voluptas quaerat necessitatibus aut necessitatibus sit corrupti aut iste culpa optio et aut nesciunt vel ipsa nobis eveniet sint eius facere facilis velit laboriosam sed hic unde aut impedit tempore ut officiis est aliquam libero sit ipsum sapiente ea consectetur ut non ut et qui ut repellendus pariatur recusandae tempore aut voluptates occaecati impedit fugit nihil quod maxime rerum dolorem dolor error expedita doloremque similique ducimus eum aliquid vitae sunt sed deserunt commodi exercitationem voluptatibus est consequatur voluptatibus aut sunt sapiente mollitia nostrum quo velit dolorem dolor recusandae molestias illo eaque rerum nostrum et ut cumque aliquam doloremque inventore minus qui architecto repellat enim quo aliquam similique ipsam dolorum dolores sed fugiat minima cupiditate sequi numquam dicta nisi impedit aut qui mollitia in nihil est ut debitis deleniti tempora magni iure tempora eius saepe nostrum blanditiis sequi autem et alias doloribus aliquam doloremque alias voluptatem repellat voluptatibus quae saepe incidunt corporis magni voluptatibus omnis voluptatibus molestiae assumenda face