INSERT INTO `course_news` VALUES ('583', '3', 'Et possimus enim voluptatum ea consequatur adipisci.', 'Odit qui repellendus ab autem qui in id et tenetur autem fugit debitis eum officiis qui cumque perspiciatis reiciendis quis corporis alias sit et tempore repellendus voluptatibus tenetur minima ut dicta repellat sed cupiditate dolor molestias suscipit vero quo enim maiores quia sit iusto non error sed exercitationem aut aliquid alias rem facilis dolores eveniet laboriosam quae deleniti qui dolore hic id corrupti ut sint cumque expedita a eligendi ad fuga voluptatem ab cum corrupti suscipit voluptates ad maxime nisi earum expedita nulla eum odit dolore ut voluptatem ut mollitia quo officia ad qui voluptas repellat quo eum vel magnam a qui quo autem incidunt et fuga mollitia eligendi quos non amet eaque earum voluptatum est aut aut sed occaecati beatae ipsa error et et et eligendi necessitatibus voluptatem expedita sit voluptatem nisi sit consequuntur iste sapiente et similique tenetur sed ut ut rerum tempore eos omnis dolores excepturi amet autem ut est esse aperiam laborum dolore non rerum culpa minima quo ab dolores totam blanditiis recusandae sed voluptatem et reiciendis quo rem dolores voluptatem eaque sed aliquid possimus ut eius non explicabo et rerum voluptas tempore reiciendis soluta sequi et voluptatem alias in rem tenetur modi corrupti mollitia et minus est minima sed velit doloremque et voluptas blanditiis beatae quis molestiae debitis et eaque molestiae molestiae deleniti saepe accusamus cum iste rerum perspiciatis non eum ducimus accusamus eligendi nemo et in tempore ab enim asperiores repudiandae reprehenderit harum beatae ut non asperiores et consequatur omnis neque repellat aperiam iusto error iusto rem rem et iusto vero quas qui quibusdam consequuntur numquam asperiores ut eaque voluptatem hic eum ut est ducimus et et veniam dolores adipisci perspiciatis porro animi commodi saepe qui dolorem cumque soluta eum possimus eos neque dolore doloribus non similique incidunt esse est dicta inventore molestias unde omnis dignissimos necessitatibus est natus sequi nesciunt temporibus sint et sed perspiciatis quos voluptas omnis optio autem non nulla est corporis atque delectus laboriosam incidunt omnis cupiditate maxime vero sunt adipisci et et et eos placeat perferendis libero sint molestias molestias eos non veniam vel unde in laborum in sed necessitatibus aut deleniti temporibus nemo consequuntur eum minus iusto et vero neque qui non deserunt qui ut qui rerum possimus sit maiores beatae qui tenetur sed modi nihil magni est incidunt omnis id amet architecto.', '1', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('584', '7', 'Asperiores recusandae repudiandae vitae et voluptates deleniti.', 'Et deserunt ducimus ex et laboriosam corporis odio non quia velit alias molestiae beatae asperiores autem molestias sit aut ut ex porro quos et maiores consequuntur sapiente tenetur et nam voluptas est omnis sed maxime nesciunt iusto eveniet laboriosam quod quia consectetur in quis dolorem nobis quasi eos quae placeat inventore est cumque dolor voluptatem tenetur quo magnam tempore et harum vitae corrupti vel tempora error quae non est consequatur repudiandae et libero blanditiis saepe aut pariatur earum maxime ducimus omnis officiis ad corrupti deserunt est fugiat enim pariatur provident labore eaque rem in quis quaerat eum labore pariatur laudantium asperiores eos qui saepe quo reprehenderit expedita qui ut autem ipsum aut illum id dolore sit perferendis quia praesentium libero rerum dolor laborum voluptatem dignissimos laborum voluptatem sit aut autem doloribus beatae facere et delectus aperiam libero numquam vel explicabo sunt nam officiis nulla possimus velit dolores est ullam cum natus dolore atque commodi illo velit ea consectetur dolor qui quod molestias ut recusandae asperiores vero libero laborum qui sed corporis eos ducimus est facere tempore quod optio doloremque dolores dolores explicabo quibusdam molestias iure amet sit at hic aut ipsum distinctio laudantium eaque nemo accusantium itaque id ea earum voluptas rerum omnis facilis qui dicta assumenda perferendis et qui dignissimos sint eius omnis quidem cum sapiente in dolorum et nostrum laborum libero laboriosam et consequatur odio beatae est occaecati et molestiae dolores quo officia sed rem earum veniam quia illo dolore ut dolorem dolor sint qui qui qui est officiis est cumque odit asperiores est odit quia quo impedit quo temporibus aspernatur quidem eligendi.', '0', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('585', '9', 'Illum et pariatur aliquam est nihil nesciunt.', 'Id atque optio dolor voluptatem et ratione eos natus iusto autem eos ratione sunt neque numquam neque et magnam voluptas est ratione temporibus commodi placeat laborum quas iure qui nihil officia est quia vel dolorum pariatur nulla autem earum ut earum id placeat vitae est voluptates esse eaque quas sit voluptatem sed enim provident rem atque sequi qui dolor fugiat magni molestiae alias dolorem ut ut corporis laboriosam exercitationem voluptates quas sit perspiciatis voluptatum quia voluptate eaque et esse occaecati qui voluptatem vel nesciunt officia enim iure minima sint explicabo ut non et temporibus sed sunt quod fugiat consequuntur nihil dolores laudantium veniam maxime minima doloremque enim ut alias illo minus voluptas quos optio veritatis repellendus quia quam est optio quo enim odio et aut modi culpa sit quia quo culpa voluptate et consequatur et quo voluptas cum doloremque ea eligendi quam dolorum sit et nesciunt quod aperiam molestias mollitia dolorum id assumenda et fuga et sed neque labore voluptatem molestiae vel quo est quae facere iure exercitationem qui velit nesciunt adipisci eum a explicabo distinctio voluptas autem ipsa voluptatibus exercitationem nihil nesciunt nesciunt eaque impedit rerum corrupti earum quasi aut repudiandae itaque rerum possimus praesentium architecto rerum aperiam nisi voluptas porro nam ex sint repellendus eos qui ut itaque possimus nisi magni ut sint et repellendus odit molestiae reprehenderit omnis non est enim deserunt eveniet libero doloribus consequatur quidem fugiat harum et ipsa atque ut laboriosam laborum enim ratione amet corporis autem aut odit officiis voluptate eum alias aperiam nesciunt quaerat perspiciatis id eius nemo quibusdam et voluptatum laudantium dolores enim est sint cum quisquam expedita incidunt.', '0', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('586', '4', 'Qui dicta exercitationem sit omnis earum temporibus quam.', 'Adipisci expedita quis nulla non voluptatem pariatur officiis omnis qui culpa id veniam hic illo repellat et optio ut dicta illo et aliquid repellat cumque voluptatem reiciendis odio rerum itaque quo velit nostrum non minima consequuntur et pariatur similique placeat est quo perferendis placeat autem expedita et magnam fugiat mollitia possimus et sit enim earum magni qui occaecati nemo esse tempore fugit esse nemo veniam aut blanditiis quaerat vel et rem qui officia est provident quia aut quo quis ea magni deleniti voluptatem rerum distinctio optio molestiae ut officiis ut impedit nihil qui et quidem animi hic sit dolorem vel magni ut assumenda sunt vel minus eos eos hic molestiae perferendis neque voluptatem repellendus accusamus quis aut iusto exercitationem voluptatum minima voluptas rem rem est sit vero libero tempora quo et quo facere deserunt explicabo nulla laborum facilis voluptatem quidem cum veritatis sint molestias impedit vel nemo exercitationem illo voluptates ut sed corporis dolores consequuntur delectus odio quidem distinctio rerum dolorum magnam repudiandae architecto magnam repellat quasi voluptatem cumque est dolor eligendi quae minus cupiditate sed voluptates eos quam nihil qui deleniti alias omnis consequatur ex asperiores in deserunt sint ut molestias qui fugiat pariatur vero expedita maxime veritatis consequuntur non est nisi ratione aut doloribus aut delectus beatae impedit repudiandae ex itaque ex occaecati qui nostrum amet sapiente consequatur impedit ipsa architecto iure exercitationem ipsam quos nulla saepe earum in cupiditate minima culpa et nesciunt inventore praesentium consectetur inventore eos ut ad omnis perspiciatis labore aut molestiae qui laudantium assumenda unde est excepturi assumenda atque voluptatem consequuntur maiores ea et fugit qui modi velit dolorem ab sequi sapiente minus velit voluptas incidunt ut suscipit doloribus perferendis inventore dicta temporibus harum error consectetur maxime quasi voluptas accusantium amet dicta rerum magnam amet vero necessitatibus vel temporibus provident magnam ducimus qui et excepturi facere dignissimos iusto et cum delectus dignissimos qui atque iste consectetur quam iusto odit asperiores et consequatur hic voluptatem nemo ullam qui animi quaerat nihil rerum consequatur ratione sint repellendus ut doloribus fuga inventore soluta eum et voluptas placeat aut quis quis aut placeat enim tenetur non.', '1', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('587', '1', 'Sapiente odit excepturi explicabo.', 'Delectus quia nam nesciunt ea ex omnis ad ullam ratione cupiditate ipsa debitis et blanditiis at numquam ipsa iste possimus ut omnis sed dicta ut ut rem reprehenderit tempore id vitae beatae architecto ut fuga illum voluptatum earum eius et minus cum dolorum minus inventore et dolor est explicabo aut qui ut dolorum earum molestiae et numquam ex quia illum eius consequatur perspiciatis nisi harum est est eos voluptate nulla iure vero voluptas fugiat natus et voluptatum consequatur sed minima fugiat eos tempora a odio aut laudantium veritatis doloribus corporis illum sed accusantium enim incidunt iste ipsam quasi provident et sit qui voluptatum cupiditate similique non commodi quo ut non natus aliquam dignissimos et eos occaecati nam nesciunt amet consequatur qui neque eaque adipisci voluptatem dolorum quia deleniti dolor et molestias adipisci eum nulla commodi impedit aperiam ex atque at perferendis vel animi non a inventore nesciunt aut officia voluptas vero nisi et vitae eos beatae hic fugiat quibusdam nesciunt nisi similique eligendi quod eum voluptates hic qui rerum earum est sunt id sit maiores minima minima expedita ipsam et voluptatem molestias repudiandae rerum repudiandae eius est nisi modi aperiam delectus deserunt nemo commodi itaque cumque deleniti adipisci incidunt est non minus aut tempora dicta modi repellat nesciunt inventore tempore sunt autem saepe qui dolore non perferendis ipsam velit nisi itaque eos cumque commodi sed quae voluptatem eos voluptatem quis enim eos dolor quia molestiae totam occaecati quas eius eligendi cumque nam voluptas ad est neque reiciendis porro occaecati animi architecto doloremque sunt repellendus minima tempore exercitationem dolore cupiditate quis occaecati aliquid similique impedit nemo error veniam ipsam numquam quo laudantium sit quis est mollitia voluptatem eveniet.', '0', '2017-05-02 22:59:18', '2017-05-02 22:59:18');
INSERT INTO `course_news` VALUES ('588', '2', 'Qui eius consectetur quia eos doloremque ratione in.', 'Harum nulla eius tempore itaque et voluptatibus quos quibusdam sed delectus tempore et explicabo perspiciatis illo ex architecto id harum quas voluptatum deleniti perferendis temporibus deserunt aperiam et consequatur minus odio sunt ratione labore quia dolores eaque nostrum non aut repudiandae et optio incidunt corporis iure unde consequuntur ut aut enim praesentium repellendus sunt eos modi dolores neque molestias adipisci sint repudiandae reiciendis placeat qui dolor saepe qui ducimus omnis magni rerum repellendus illum architecto qui sint eos ipsum qui molestias sapiente aut vitae molestiae quidem consequatur ab deserunt iste explicabo voluptas ea non eligendi sapiente vero quos consequatur id in modi doloremque libero quis repellendus impedit deserunt dolores sunt quisquam quasi in vero sint perspiciatis deleniti quae repellendus ad ducimus minima omnis iure mollitia quis et quo aliquid et fugit consequatur quis debitis quos minus eligendi labore at qui dolores qui dolorum exercitationem et occaecati doloribus vel ipsam qui sequi hic amet provident consequatur et dolorem maxime eos ut corrupti velit veritatis perspiciatis nesciunt accusantium quis beatae quia aut quo quod molestiae eos tenetur nisi laborum nobis cumque vel consequatur cumque est accusantium at quasi voluptas eum eaque molestias laboriosam provident aut qui laboriosam alias et sint et temporibus perspiciatis ad aut distinctio perferendis voluptatem ipsam excepturi non sit et vel et est est ut provident sed facilis beatae et inventore nulla architecto impedit explicabo consequuntur cumque tempore.', '1', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('589', '10', 'Ipsa est dolor aliquid in.', 'Quidem tempore non magni autem eos explicabo ex qui omnis nam odio voluptas consectetur nulla voluptatibus ut vitae nesciunt non delectus perspiciatis ipsa necessitatibus dignissimos est tempore ipsam esse non praesentium eum molestias distinctio debitis voluptatem rerum quia dicta magnam corporis rem nemo voluptas ut qui eos aut ratione consectetur voluptas ut architecto vitae vel rerum quam sequi optio rerum voluptas qui natus debitis sed a et facere soluta eveniet maiores laboriosam praesentium quos error doloribus qui deleniti illum voluptate id et non sed ut ea nostrum nemo perspiciatis laborum dolores fugiat asperiores esse sequi sit omnis voluptate aut expedita ut pariatur veniam doloremque vero aliquid id id dolore placeat nihil dignissimos qui sed sed voluptate est et quia est tempore soluta deserunt autem reiciendis dicta et iste quod magnam deleniti nihil iusto laborum neque cumque non illo voluptas enim hic sed officia animi enim in ut non sit porro enim fugit ut tenetur pariatur et perspiciatis quam magnam quaerat fugiat dolor eos qui eaque eligendi mollitia non quos atque placeat et odit fuga molestias vitae voluptas perspiciatis qui vero autem optio id fugiat consequatur et eos et porro eveniet et est itaque ab iusto odit et ut non eaque ad explicabo dolor rem est et voluptates repellendus at quidem rerum voluptas quo aut saepe aut totam rem ipsum odit dolores possimus dolor et voluptas quia placeat delectus sequi possimus in recusandae voluptatem illum consequatur minima blanditiis voluptas repellat adipisci rem ut labore enim ut sint accusantium voluptatibus nihil mollitia natus dolorum asperiores tenetur corrupti labore expedita velit dolores ut deserunt eum est quia neque quis sed itaque voluptatem odio quidem a deserunt saepe earum aspernatur vel in sunt hic unde porro possimus reprehenderit ab beatae optio pariatur ducimus assumenda aut dolores velit et quas excepturi doloremque excepturi fuga aut tenetur minima totam eaque culpa doloribus inventore ullam blanditiis aut molestiae modi magnam qui inventore facere suscipit id tenetur mollitia qui perspiciatis quidem occaecati ad est sed rem autem quia accusamus odio ea ut sunt hic sunt consequatur qui dolorem repellat odit ut.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('590', '3', 'Cumque numquam est minima aliquid.', 'Eum quo quo adipisci quos accusantium velit est illum id numquam et ducimus ut ad vero laboriosam quas eligendi quae et dolores consequatur omnis pariatur eligendi temporibus harum debitis eveniet itaque quis vitae illum rem nostrum beatae autem nemo corporis eligendi laudantium atque id nihil saepe eligendi sit fugiat reprehenderit voluptas dolor tempora aliquam dolor quos fuga doloremque dolore tempore non veniam quis quidem necessitatibus sunt commodi fugiat et consequatur aut unde ut rerum et ducimus laudantium dicta distinctio qui voluptatibus voluptatem quo voluptatem doloremque ipsum corrupti ut aliquid rerum mollitia quidem et tempora culpa dolores quas et vel doloribus non omnis repudiandae nostrum in vel quos id omnis aperiam ullam eos consequuntur corporis aut maiores quae dolor et dolorum nostrum omnis nulla laboriosam voluptatem culpa eaque fugiat harum quam autem eius voluptatem nisi provident atque neque nesciunt perspiciatis repudiandae dolores voluptatem animi doloribus itaque est qui at dolor amet accusamus aut illum distinctio quia et non dolorum commodi aut atque dolorum sunt aut vel consequuntur nihil occaecati alias dolores modi ducimus id ipsam corrupti ipsum tempora eum quibusdam est et incidunt sapiente qui numquam incidunt et quaerat explicabo dolor eos minus laboriosam quasi ut quia eaque consequatur non illo dolorem temporibus eos expedita dolores quisquam et voluptas est et ipsa vero necessitatibus ad aliquid molestiae cum eum eveniet dolores illo molestiae non ut impedit architecto aliquid corporis totam error sapiente non voluptatem et voluptatibus magnam dolorem nobis non dicta blanditiis asperiores aperiam perferendis repellendus id est molestiae numquam impedit adipisci temporibus quo quia incidunt error dolorum harum maiores tenetur et velit qui quibusdam et dolorem nihil rerum debitis consequatur ut ut facilis eveniet commodi voluptates quam enim nulla cupiditate sint architecto reprehenderit non reiciendis culpa aliquam non distinctio sit quidem dolores ducimus nulla autem animi qui quis accusamus sunt quo id veritatis ad ullam ut minus exercitationem facere et dicta vero recusandae vel iure aliquam illum facere maxime est molestiae aut quia a laborum aut adipisci atque repudiandae similique a voluptates eveniet id neque cumque modi est molestias quam odio consequuntur sequi voluptatum est dignissimos aut in ipsam reiciendis vero voluptatem sed occaecati blanditiis odit tenetur et maxime consequatur facilis nesciunt neque nesciunt libero tempora doloremque beatae occaecati numquam asperiores soluta ea similique nostrum ut soluta autem sequi eos quae distinctio in suscipit eaque error libero eum et alias hic ut esse reiciendis qui sequi quia autem velit dolores facilis ut quo.', '1', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('591', '4', 'Aut asperiores cupiditate aut dignissimos itaque.', 'Repellat quia consequuntur eaque consequuntur id praesentium rerum ut impedit fuga aut voluptate in et deserunt et et sit ratione asperiores corporis magnam consequatur omnis accusantium rerum cumque doloremque facere excepturi atque voluptates mollitia nihil ea optio sint sed molestiae et non expedita pariatur dolor libero quae ut totam fugiat omnis dolor ut voluptates fugiat consequuntur tenetur fuga quam voluptas possimus placeat eaque odit et necessitatibus sint voluptatem esse earum numquam minima aliquam labore rerum qui ducimus quia vel et ea repellat omnis iusto natus dolores et deserunt hic placeat maiores magnam rerum nisi at explicabo ad voluptas velit magnam earum ipsam fuga laboriosam inventore et sed tempore culpa voluptatum aliquam voluptatem inventore excepturi rerum rem omnis vero itaque quasi in nostrum quis sit natus qui delectus in explicabo deserunt et maiores est ullam sed maxime officia eligendi ipsam enim et officiis cumque qui dolore sunt ut numquam vitae ut fuga magni aspernatur id quod laboriosam ab sapiente culpa sunt inventore consequuntur laboriosam id expedita omnis praesentium autem dolorum ut quibusdam optio unde omnis aspernatur quia doloribus nobis et et ipsam ut numquam commodi.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('592', '9', 'Tempora odio iste ducimus expedita.', 'Dolorum et exercitationem nam consequatur dolor nobis nesciunt vel deserunt fuga vel reiciendis saepe quos mollitia et et autem asperiores fuga vel iure sed expedita quaerat autem qui voluptas consequatur error ipsa officiis eum modi eos explicabo error provident aut maxime esse id exercitationem illum impedit quos tempora enim architecto dolor aut nemo unde a eaque impedit sit maiores nobis dolorem et sint et aut maxime qui autem officiis molestias fugiat nisi sunt consequatur explicabo repudiandae praesentium quia et eum expedita praesentium in dolore rem illum sequi possimus vel minima consequatur molestiae natus et natus et non occaecati illo enim fugit nihil numquam temporibus minima rerum ut aut et qui aut ut quos maiores similique minima consequatur qui consequuntur provident quod rerum blanditiis temporibus dolorum molestiae ea impedit illum possimus in necessitatibus enim facilis molestiae unde rerum cupiditate illum voluptatem et commodi incidunt voluptatem quaerat commodi blanditiis qui illo tenetur saepe ut temporibus ipsa quos inventore fugit vitae ex aliquam commodi quisquam voluptatum qui aut facilis voluptatem sed commodi illo quas consequatur omnis aut excepturi dolor quis nam rem assumenda quia dolorem tempora inventore voluptatem ut vitae placeat ea earum voluptas neque quam et consequatur qui dolor quia optio iure nobis eum fugit aut dolorem veritatis ex et illum vel ut voluptas eveniet eius voluptas illum cumque a quia totam earum distinctio unde et inventore molestiae delectus quod beatae rerum voluptates et ipsam impedit hic ab temporibus esse reprehenderit praesentium accusantium quaerat amet et iusto laborum libero qui occaecati aut reprehenderit dignissimos ut id rerum sapiente ab tenetur et doloribus laboriosam cumque et sint eius at et aut velit quos quia numquam incidunt omnis corporis mollitia voluptatem dolorem commodi sed velit reprehenderit dolores voluptatem debitis tenetur exercitationem earum vitae at et magnam repudiandae repellat animi fuga qui inventore quaerat maiores quia et et quaerat velit omnis magnam sint sed nam vero cupiditate non quae ipsam vero aut sunt accusamus aspernatur deserunt ut architecto ea incidunt quis eos omnis nemo pariatur et repellat voluptas possimus nesciunt quia quae aspernatur consequatur aliquam minus quod hic consequuntur earum amet ullam et aut in vitae et ratione est aut nulla consequatur et aut omnis deserunt possimus qui omnis commodi voluptatem voluptas mollitia odit occaecati quis placeat quo neque aut rerum placeat commodi rerum quisquam est sunt ducimus distinctio ipsum similique ut rerum nobis voluptas qui.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('593', '10', 'Nostrum doloribus nihil voluptas est minus quia.', 'Explicabo ratione rerum tempore culpa fuga atque alias quia laudantium voluptas fuga cumque doloremque voluptatum illo ut ex ullam aut esse temporibus eaque incidunt harum sed sed saepe impedit enim eaque qui nostrum voluptatem eos rem quia nulla modi placeat facilis ut suscipit at dolorem sit iste aut dolorum qui quasi iure iusto commodi voluptas qui esse voluptatem fuga iure maxime est saepe eos facilis aperiam excepturi sit non incidunt accusamus non porro quia facilis recusandae deleniti quis vitae incidunt tempore enim excepturi sit fuga rerum doloremque sit modi odit aut quaerat nam non minima sequi similique dolorem molestias asperiores quis esse sunt est inventore et illum nemo magni voluptatem suscipit voluptatibus et eos molestias commodi nihil omnis repudiandae a deserunt ut accusantium veritatis aut eaque minima totam quod quae provident est eligendi debitis sint vitae rerum reprehenderit laudantium reiciendis quia asperiores earum illum aut aut quis in enim eius nesciunt qui quis amet eligendi dolores beatae repellat assumenda odio vero quia unde inventore sequi vel consequatur exercitationem labore expedita qui quia eligendi ducimus eius fugit dolorem ut ut dolore repudiandae maxime ut nisi tempora aperiam voluptate reiciendis sint eos nulla id ab et non illum magnam accusamus blanditiis et non sed in deleniti voluptatem distinctio suscipit suscipit amet amet mollitia magnam voluptatum dolores soluta esse ipsam aut doloribus ut deserunt distinctio pariatur molestias ullam magnam distinctio deserunt corporis repellat fugiat vel eos sapiente sit ut ex mollitia et quisquam repellat praesentium culpa iure est assumenda eos magnam vero facilis pariatur aliquid odio iure numquam sit numquam molestiae aliquam odit neque doloremque et illum eius aut quae explicabo inventore accusantium eligendi voluptatem ea assumenda quia voluptatem ducimus iste aliquid deleniti inventore totam et ipsum est est autem eum ut voluptas ut consequatur sint iste ab perferendis sed consequatur dolor odio dolore.', '1', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('594', '3', 'Necessitatibus ea quibusdam commodi totam optio veniam tempora.', 'Nesciunt et voluptatibus est est itaque ut voluptatem porro et quis ut in voluptas at doloribus adipisci recusandae aut qui vero rem qui debitis a non vero illum deleniti est quo quam nemo accusantium quia rerum sunt consequuntur animi qui iste nulla explicabo suscipit adipisci aliquam est eum quia qui dicta rerum quam facere laudantium rerum voluptatem id molestiae nisi reiciendis voluptatem ut veniam culpa quod quaerat necessitatibus at cupiditate aliquid veritatis error aliquam et dignissimos quia recusandae voluptas molestiae voluptas expedita facere ducimus reprehenderit ratione quia error sit voluptate laborum veritatis eius molestias odit alias quisquam tenetur et nobis deleniti repellendus alias a adipisci quasi dignissimos nihil nostrum ut culpa earum modi delectus veniam placeat similique ullam qui omnis ut incidunt ad maxime voluptas et consectetur officia et voluptas est aperiam dolorem doloribus sint deserunt perspiciatis cupiditate voluptatem non vero aut magnam ratione quo commodi quod nostrum voluptas et ut fugiat vel dicta dolores eveniet aut et rerum voluptatem expedita sunt voluptas consequatur sed sit ut vel esse ut labore quisquam ab alias aliquam dignissimos et odit vitae dolores architecto non quam odit ipsam maxime minus est rem hic temporibus sunt qui dignissimos unde suscipit mollitia ab est itaque quidem dolorem et possimus quo adipisci qui sit ut quis ut amet alias modi est iure voluptas temporibus ut perspiciatis excepturi iste tenetur maxime suscipit qui molestiae aliquam aut et necessitatibus non quae exercitationem dolores cum reprehenderit iusto voluptatem incidunt ipsam nulla nostrum quo explicabo alias veritatis molestiae iure repellendus maxime et deleniti distinctio explicabo rerum voluptas vel impedit ad veniam qui voluptate assumenda nobis rerum et voluptas earum quas a ea accusantium et hic deleniti quis error et et minus eos fugiat magni enim cum consequatur quia necessitatibus voluptatibus eligendi quidem a dolore adipisci excepturi sunt soluta et illo rem voluptatem fugiat perferendis occaecati incidunt mollitia incidunt distinctio molestiae et ab rem tempora et quod cumque accusantium ipsum sequi qui totam adipisci aliquam voluptas perspiciatis consequatur id asperiores assumenda unde eos aspernatur corporis error molestiae molestiae voluptate iure tempore similique enim facilis aut velit ducimus.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('595', '3', 'Aut facere minus laboriosam.', 'Odio asperiores incidunt consequuntur ratione porro molestiae illum dolorum sit accusantium et libero ullam molestiae consequuntur nemo autem non inventore sit natus quod non perspiciatis tenetur quia voluptates numquam hic nostrum qui sit est qui qui laboriosam praesentium similique iusto ratione eveniet eum dolorem consequatur dolores inventore nulla ad dolor dolor non minima aut sed est optio perferendis voluptas aliquam consequatur magnam sed nostrum omnis molestiae ea unde et a ut qui neque voluptates dolore suscipit eum nihil suscipit odit aliquam et fugiat nihil in doloribus sunt ad qui aspernatur cumque voluptate fugit voluptates aperiam excepturi non qui quo at odio maxime ut corrupti mollitia eos doloribus nulla perspiciatis sequi odio qui corporis sit voluptatum commodi non velit harum blanditiis incidunt adipisci non quam consequatur est ducimus saepe ex eveniet ullam eos fuga unde voluptate corporis ratione assumenda excepturi sint quisquam asperiores qui ut sunt at omnis quas fuga accusamus corporis nihil alias laudantium aperiam et et necessitatibus harum et unde dolorem sed vel quos nobis repellat voluptatem soluta a vero adipisci officiis dolore asperiores omnis culpa placeat consequatur asperiores eum dolor totam culpa aut aut odio minima voluptate voluptatibus ipsum eligendi quisquam praesentium cupiditate aperiam maxime debitis in aut est sapiente incidunt illo laboriosam et quas officia molestiae tempora unde excepturi vitae et error ratione quis molestias qui doloremque esse est illo corrupti aut doloremque asperiores quod ea neque accusamus eveniet dolorem quidem ea ipsam occaecati officia voluptatem harum cupiditate minus est quasi est adipisci consequatur sed dolores laboriosam rerum et quisquam.', '1', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('596', '2', 'Vel molestiae iste dolor.', 'Alias atque est explicabo perferendis in non est qui id ratione eos illum sapiente quis ut id voluptas et quia eum dicta doloribus dolorem quo et laudantium ea eos impedit iure laborum qui quis saepe nostrum molestiae voluptates labore aut ex eum qui aut inventore occaecati alias autem ea quod sunt perspiciatis eum commodi architecto accusamus et aperiam non tenetur sed perspiciatis recusandae nobis dicta dolorem corporis rerum recusandae voluptates non dolor reprehenderit minus iusto aut voluptatem impedit quia veritatis autem provident et dolores suscipit dicta dolorem odio excepturi odit voluptas quia maxime qui nisi et amet est sint sit et ut odit et quas iste voluptates corrupti quaerat voluptas eos numquam nam qui porro in aut quo asperiores est officiis voluptates iusto in ut blanditiis pariatur autem voluptatem occaecati rerum non est animi consequuntur asperiores aut animi placeat perferendis ipsa saepe corrupti itaque tempora aut occaecati ad explicabo et ea necessitatibus voluptates adipisci dolores voluptas sequi sapiente soluta voluptate ea occaecati rem quis earum sapiente qui quas quibusdam facere similique voluptatem error rerum earum rerum ut hic molestiae vel odit vel accusantium tempore cupiditate eveniet repellat incidunt fugiat officia ratione amet dolores dolore aut quo tenetur maiores facilis sunt ut in corporis iusto dignissimos ab placeat praesentium et aut dicta delectus harum molestias deleniti aut esse asperiores ratione impedit non sint labore sed eum asperiores labore facilis consequuntur sit reiciendis et pariatur impedit laborum quis quia suscipit qui doloremque rerum fuga dolore earum rerum et modi amet qui rerum quaerat fugiat architecto reiciendis quis et quisquam non veniam labore aut culpa consequuntur non velit ut voluptas iusto perferendis est nobis non qui sed iure laborum quaerat quos in non eligendi atque consequuntur ut qui quae in architecto deleniti ex dolor nihil magni sequi officia id asperiores iste cum laboriosam perferendis provident qui beatae accusamus voluptatem hic iusto et ipsa accusamus illum repudiandae quae quam aliquam nostrum nihil quis libero ut ut rerum aspernatur deleniti architecto enim sit et enim reprehenderit iste asperiores quis illo qui dolorem qui dolor aut odit quia quia totam exercitationem hic et asperiores non voluptatem corporis molestias laudantium ut adipisci laboriosam quisquam quis tempora magni animi alias velit cum et dignissimos ratione minus officia ab dolor enim non.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('597', '1', 'Provident et quis soluta rerum et excepturi.', 'Enim placeat praesentium qui similique non mollitia debitis sit error non ut molestias sed asperiores non aut accusamus ut pariatur totam quia assumenda quia qui atque et dignissimos laborum iusto voluptates sed deleniti itaque non praesentium architecto omnis quibusdam et culpa eum et impedit ab et totam qui quo omnis distinctio voluptates expedita inventore et voluptatem inventore tempore rem dolor et veritatis iste repudiandae dolor tenetur ex laudantium quae consequatur rerum deleniti ea magnam quasi fugiat quis aut possimus dolores et exercitationem eveniet ipsum rerum eligendi quod officia et optio necessitatibus est commodi laudantium quibusdam vel asperiores perferendis similique totam quis deserunt perferendis ducimus consectetur voluptate ullam excepturi vitae cum quas odio aliquam dignissimos omnis nihil molestiae perspiciatis non ut sunt porro accusantium blanditiis qui quod quos officiis qui explicabo aut porro quia animi nam et qui accusamus pariatur sequi fugit enim dolorem consectetur suscipit quaerat necessitatibus quam perferendis sit accusamus aut aut iusto et aperiam vel consequatur neque voluptatem et quia sint rerum et natus sequi mollitia impedit explicabo vitae eius tenetur recusandae deleniti alias quo voluptas esse sint consectetur vero voluptate dolores autem neque est cumque fuga quasi voluptas animi explicabo maxime sed ut quam perferendis quisquam alias quis culpa occaecati nobis ut dolorum consectetur qui maiores eum ratione natus illum hic labore beatae placeat nulla rem optio molestiae enim nobis nisi error possimus similique veniam qui soluta consequatur qui quia magni sit nam qui ducimus sequi tempore expedita deleniti iste odit repudiandae culpa similique dignissimos fugiat ut magnam qui ipsam aperiam vero in sit sequi omnis aut ut molestiae vitae iste expedita autem et quod possimus facere est omnis fugiat asperiores harum laudantium cu