INSERT INTO `course_news` VALUES ('598', '8', 'Qui esse enim aut.', 'Corporis sit consequatur dolor possimus dolore et ducimus enim aut assumenda dolore eos ut consequatur totam fugiat aperiam perspiciatis voluptatem in est id consequatur et possimus dolor eos ea aut voluptate fugiat animi delectus et molestias optio perspiciatis nobis eaque maxime possimus in minima perspiciatis quisquam porro praesentium consequuntur omnis similique consectetur temporibus sit doloremque dolor quisquam sit et molestiae et nesciunt blanditiis nihil distinctio corrupti voluptas cupiditate ratione nobis et maiores autem doloribus illum tenetur aperiam aperiam maiores dolor voluptatum quia fugit expedita sit non pariatur dolores quia facilis officia culpa non est sit fuga qui ipsum soluta non placeat sed voluptates odit perferendis in nobis consectetur et ea eligendi quo aperiam nihil repellat iste voluptas nemo quia perspiciatis repellat non similique sed vitae aut non quos dicta recusandae sit et nihil laboriosam eaque distinctio eius consequatur quos corporis tempora facere sint provident ut ut error molestiae distinctio dolorem velit perspiciatis voluptatibus quia in molestiae rem praesentium fugiat tempora veritatis suscipit et reiciendis quidem aut non saepe minus magnam incidunt unde voluptates voluptatem reprehenderit id nemo incidunt quaerat cum ratione ut qui mollitia sed ab recusandae fugiat id quia vitae suscipit non quia voluptas ex iusto atque omnis aut vel qui cupiditate laboriosam animi doloremque voluptas impedit dolor quia non illum reprehenderit laborum ab dolores maiores cum qui consequuntur atque est in sed cumque id mollitia ratione dolorem debitis qui adipisci animi nihil quae excepturi est laborum deleniti consectetur aliquid recusandae est numquam voluptatem est dolore cupiditate aut totam dolorem voluptates delectus perferendis voluptas veritatis cum magnam occaecati laboriosam aliquam adipisci blanditiis possimus aliquam enim minima et eius sint aliquam ex qu