INSERT INTO `course_news` VALUES ('599', '1', 'Commodi quia voluptatem nihil.', 'Aperiam iusto at quis culpa laborum iste unde ullam optio non exercitationem in dolore explicabo at accusantium optio sit modi vel magnam voluptas omnis tenetur et illo minus nesciunt occaecati vitae dicta aut inventore ut repellat voluptatem consectetur reiciendis ea consequatur est dolor quo impedit saepe autem tempora nihil facilis debitis commodi eveniet enim eaque debitis voluptatem molestias officiis omnis dolore vel vel nesciunt ut distinctio atque nihil numquam aliquid adipisci beatae veritatis omnis neque voluptatem voluptas voluptatum delectus temporibus voluptatum quidem rerum incidunt quae et quia velit omnis tempore ut ullam fugit quis atque eveniet quam fugiat maxime soluta laboriosam deleniti vero ut laboriosam amet nulla ab placeat harum voluptatem hic repellat blanditiis amet nisi ea aperiam aperiam ipsum cupiditate tenetur expedita sequi nisi sit tenetur eum ducimus in nesciunt voluptas corporis cupiditate error omnis animi veniam ut nulla harum nihil ab quibusdam recusandae tempore ut quisquam aut commodi nemo quam illum ipsam quidem tempora ipsam ex consequatur rerum totam dolorum officiis vel voluptatum ex cumque consequatur officiis quae fugiat molestiae quia doloribus soluta sed corporis asperiores error distinctio omnis sint omnis tempore et et molestiae pariatur sed nulla corrupti dolorem labore quibusdam voluptate accusantium quia in consequuntur illum sit tempore quidem rerum blanditiis soluta non nihil id enim deleniti et quia voluptates eaque consequatur repudiandae aut corrupti et et ad ducimus vitae sed velit sint vel qui totam at quam repudiandae eum voluptas vel quia aut autem possimus vel nulla doloribus corrupti dolorem nulla ratione molestiae sit soluta rerum aliquid nihil eos sunt nostrum amet qui quia nihil aut reprehenderit.', '1', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('600', '7', 'Exercitationem quod dolores molestias aut sit omnis vel.', 'Iste voluptas et dolor ut tenetur autem rem ratione quis voluptatum autem repudiandae porro et deserunt doloremque inventore ipsa qui illum voluptatem quo doloremque beatae et beatae facere harum cupiditate enim illum aspernatur maiores natus quae sit facilis nisi sint ipsam facilis ullam ut inventore a repellendus consequatur laborum et voluptas perferendis iste illo sed ut id et eos laudantium corporis et nostrum dolorem praesentium beatae consequatur temporibus vero sed quidem ipsam deserunt cupiditate aperiam rerum quasi et voluptas quasi quia qui vitae nihil totam ipsam doloremque reiciendis qui amet aspernatur at similique neque non at in libero unde porro molestiae dolor quia at commodi corporis vero et voluptate sed sequi suscipit minima ipsum esse odio quisquam eaque consectetur quo cum occaecati aut officiis eum deserunt provident numquam error rerum et at ducimus distinctio illo tenetur soluta suscipit ut est eos accusamus quibusdam occaecati enim eius nam tempora totam voluptas ad est repellat est quae magnam ipsum ad ipsam ipsa nostrum aut odit et nisi expedita nihil fugiat dolores voluptates vel laboriosam cupiditate vel libero deserunt quibusdam ducimus recusandae incidunt eum aperiam veniam nostrum veniam inventore autem ut voluptatem rerum voluptatem laboriosam id maiores quidem recusandae.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('601', '2', 'Officiis aut esse numquam blanditiis et et.', 'Culpa voluptatem veniam ab distinctio similique omnis sint quas fugit cum dicta eaque hic vitae vitae rerum deleniti enim a magnam qui repudiandae dolores praesentium eum aperiam minima occaecati doloremque asperiores officia aspernatur deleniti minima incidunt et et nemo ut unde pariatur eligendi consequatur nulla vero voluptatem numquam omnis omnis sit eveniet quia soluta aut atque accusamus illum sunt doloribus delectus sint aut sit harum vel ad at rerum in in dolorum sit velit quos nemo voluptatum nesciunt veritatis hic inventore asperiores voluptatem voluptas vel quia consequatur qui tempore amet in amet velit qui eius ut officiis ad aut dolorem voluptas et deleniti et et quibusdam saepe voluptatem in voluptas qui quas magnam facilis voluptas dicta facere deserunt sed eaque officiis dolor aspernatur vel sunt qui molestiae illo debitis eum sit perspiciatis aliquid illum debitis et illo non eum praesentium eaque rerum odio suscipit necessitatibus quaerat laudantium vero sit a quas et voluptas ut dicta eum aut nam corrupti natus consequatur qui qui deserunt cupiditate magni aut earum architecto et error dolorem dolores voluptatem rem saepe ipsam assumenda aliquid inventore laboriosam voluptatibus assumenda sequi illo ex quae blanditiis dolor ipsam voluptatum quidem ducimus deserunt id reprehenderit sequi commodi labore qui omnis fugit tempora tempora quod accusamus quo sit ipsum repudiandae voluptates minima molestiae reprehenderit nobis aut distinctio repellendus nihil aliquid culpa recusandae velit maxime voluptatem porro non consectetur quos et nam cupiditate iusto eaque nobis qui est velit voluptatem aliquam voluptatem non dolorum blanditiis est ipsa quia facilis nihil laudantium quia facilis aspernatur illum libero fuga nulla amet atque et aut odit dolor incidunt quia voluptate omnis culpa voluptates animi natus voluptatem qui earum sunt eum distinctio exercitationem