INSERT INTO `course_news` VALUES ('602', '8', 'Est incidunt eos quia velit quia.', 'Odio sit quis doloremque vel voluptatem pariatur consequatur hic sapiente sapiente numquam repellendus debitis enim fugit aut ea et qui vel unde quaerat dolores commodi nemo sint rerum maiores reprehenderit natus nisi non ut rem voluptate quis modi dolor commodi sed nulla laboriosam nulla reiciendis quas deleniti deserunt voluptatem eaque perferendis voluptas incidunt in aspernatur nobis mollitia sapiente similique dicta molestias voluptatibus odit ullam consequuntur quo odio maxime consequatur sed voluptas enim fugit est quae voluptatum dolorem earum totam distinctio repudiandae sunt sit deserunt eum eius illum non est ullam in voluptatem occaecati quae adipisci ut vel sit dolores culpa et rerum rerum et mollitia qui esse nulla aut in assumenda est ab sed facere in ea odio aut rerum rerum a corporis officiis quis ex aut consectetur in hic nihil incidunt eaque rerum dolores deserunt possimus architecto autem soluta laborum dolore ad harum quia eum ipsum exercitationem rem esse voluptates ipsa totam est ut molestiae tempora sed maiores at soluta laborum voluptatem officia nostrum aperiam tempore id dolor molestias in cupiditate perferendis maiores quidem at possimus nisi dolorem vel occaecati maiores totam repellendus aut eos iure quis odit nobis laborum et et dicta tempora omnis omnis quam iure neque sed sed placeat ratione temporibus consequatur enim sequi et ut consequuntur laboriosam aut corporis exercitationem dolor velit reiciendis dolorum non dolore repellendus deleniti odit qui voluptatem et aut illum incidunt molestiae quia nobis sit dolores neque odit corporis recusandae voluptas nam occaecati adipisci tenetur quia qui distinctio adipisci magnam consequatur placeat deserunt omnis voluptates incidunt quia repellendus optio expedita.', '0', '2017-05-02 22:59:19', '2017-05-02 22:59:19');
INSERT INTO `course_news` VALUES ('603', '9', 'Veritatis assumenda consequuntur deleniti voluptatum non optio enim.', 'Error explicabo dignissimos vel quae aperiam minus et omnis aliquam quasi corporis repellat maiores quo iste nisi impedit saepe placeat ut est molestiae rerum beatae minima fugiat est sunt et autem soluta ab expedita quod ratione laborum dolorum maxime rerum ad hic tempore vel ea ut sit et perferendis eos quia dolores unde dolorum quis ut odio ut corporis a voluptas omnis sunt voluptatibus ad odio quis non amet doloremque incidunt sint nihil ullam harum quisquam molestiae ullam porro illum eius repellendus accusantium ducimus explicabo sed dolores sit nobis sit minus sed quisquam aperiam hic dolores dolor velit provident officia voluptas totam quo vitae modi officia eos dolore vero libero deleniti harum error necessitatibus consequatur aut quae est autem est soluta dolor aut voluptate ut porro dolores tempore consectetur et recusandae autem et sequi ut ipsa ex consequatur aut officia eos totam ducimus minus blanditiis voluptas id sit consequatur adipisci et qui voluptas eveniet ad maxime qui id ad et architecto eveniet id ut rerum omnis voluptas quo omnis quae aut quis beatae tenetur nihil sunt qui ipsa id ad et quia culpa nesciunt possimus est quod nisi quasi saepe error iure accusantium aliquam vero et vel eveniet eos doloribus animi quia dolorum asperiores soluta et sunt mollitia minima non dolorum impedit ut culpa reiciendis quisquam ut natus nisi sequi pariatur quae debitis perspiciatis omnis consequuntur vero delectus amet eligendi ipsam quisquam nesciunt impedit deserunt fugiat laboriosam suscipit omnis dolores dolorum iusto quo quasi et similique ex labore sed dolorem est autem sequi nostrum reprehenderit quo eligendi dolor voluptatem quia qui aliquid magni atque voluptatum neque quos id dolores officiis deleniti omnis enim sed aliquid iste rerum ut ab voluptate eius mollitia nesciunt sunt omnis rerum culpa reiciendis qui laudantium neque ne