INSERT INTO `course_news` VALUES ('604', '1', 'Veniam repellat voluptas velit.', 'Molestias ad praesentium possimus enim dolores aut delectus ipsa quam assumenda eum enim et quia iure velit velit incidunt culpa dolores dolores rem ipsam voluptates voluptas sit rem laboriosam sit et deleniti sed illum et quidem officiis nisi voluptas eveniet in nam aut quod hic eligendi provident minus voluptas voluptas voluptatem perferendis omnis cum quidem sunt necessitatibus dignissimos commodi et cupiditate dolor fugit porro debitis et saepe dolor dolorem sit repellat nulla accusamus ullam minima sed et culpa officia adipisci tenetur nemo deserunt deleniti atque rerum earum nam voluptatum molestiae totam nemo consequatur delectus perspiciatis nulla nisi tempore laboriosam dolorem culpa quo enim esse aspernatur rerum possimus et deserunt voluptatem aspernatur sunt laudantium saepe consequatur soluta odit et qui porro culpa saepe eum quasi enim debitis blanditiis doloremque consequatur aut temporibus rerum incidunt quia reiciendis perspiciatis autem alias quam maxime enim quasi quod facere autem optio sint ut maxime ut laboriosam animi maxime sit necessitatibus ut illum temporibus debitis minus aspernatur voluptate illum ipsam autem neque rerum ullam voluptas et dolorem ipsa ea beatae blanditiis ut at voluptas doloremque repellat dolor.', '0', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('605', '3', 'Repudiandae consequatur quis autem et enim dolorem aspernatur.', 'Delectus rerum rerum quis rerum distinctio magni cum quis ut nemo quasi ut qui itaque perspiciatis est beatae et ipsum itaque sint qui eos velit et fugit non ut consequatur placeat labore et quo error deserunt ut vitae veritatis rerum delectus rerum in officia saepe saepe consequatur accusamus et voluptatum eum unde molestiae accusamus dolorum enim voluptates aliquam dignissimos veniam totam vero velit ut quia rerum molestiae consequatur repudiandae consequuntur magni perspiciatis quis quas culpa suscipit neque esse in ut illum animi rerum dolorem autem est ab enim non nihil quos nostrum maiores occaecati totam consectetur est sint omnis et rem a ut quod magnam corporis dolores dolorem perspiciatis modi similique veritatis cum et aut neque delectus aspernatur rerum rerum culpa omnis veniam exercitationem in omnis blanditiis occaecati voluptatem et dolores aliquid omnis impedit deleniti optio quod quo quia non dignissimos eos explicabo pariatur ratione voluptates laborum possimus modi ipsa est ut neque nulla ut minus commodi suscipit adipisci expedita eaque qui omnis nihil porro velit odio consequatur veniam amet reiciendis similique ea id et delectus mollitia ea ut dicta odit cum sint tenetur accusamus blanditiis dignissimos.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('606', '10', 'Et rerum voluptatem ut aspernatur voluptatem.', 'Sed minus aut ipsa autem eum ducimus quia eveniet corporis accusantium odio aperiam ducimus quibusdam sint incidunt commodi rerum at vitae accusantium quas sed cumque dolorem delectus id velit quas alias sint doloribus enim quia ex inventore dolor harum dolorem qui cum libero laborum et illo velit saepe harum temporibus exercitationem sunt molestiae eligendi error voluptatibus eum suscipit et dolores perferendis amet qui nostrum fugit facilis dolor est quaerat aut quia vitae exercitationem praesentium suscipit sed harum error ut consequatur molestiae aut blanditiis officiis ipsum ut incidunt sed laboriosam debitis harum sequi dolores optio nesciunt non perspiciatis excepturi aliquam quos deserunt necessitatibus omnis ut et molestias ratione modi officiis et atque voluptas quia aut quisquam vel saepe sapiente eveniet et reiciendis deserunt inventore sed perspiciatis possimus veritatis enim tenetur voluptatibus alias odio in rerum et eum id quis voluptatem eligendi dolorem voluptatum cumque aut excepturi a possimus sunt autem non harum illum et iste deleniti quaerat accusamus ea tempora et unde maxime dignissimos iure quam nemo consequuntur debitis quidem animi et odit beatae odit repellendus quia molestias voluptatem consequatur et facere iusto quia dolorem pariatur eum autem labore consequatur eos reprehenderit optio architecto sit eos sed exercitationem quia sit ex id architecto omnis quae explicabo sit soluta possimus pariatur culpa fugit iusto nam deserunt eos cumque cumque.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('607', '9', 'Aliquam eum illum totam officia modi aut ab.', 'Similique rerum earum molestias cumque ab praesentium assumenda autem cumque id non magnam architecto et cum vel optio molestiae et rerum harum error mollitia dignissimos ut vero nihil aut eum quia quo voluptatum officiis id ut praesentium ut in pariatur beatae et autem at numquam ex sed sapiente consequatur commodi et ad ut quibusdam est et sit nihil aliquam eos minima quibusdam voluptatem sed illum eum facere et nisi ipsum unde sint qui dolores consequuntur autem fuga et nostrum numquam quisquam quo et nam est esse eum eum illum facere accusantium earum beatae vel non culpa excepturi quia neque sunt est dolores ipsam eligendi et dolorem pariatur ea expedita et quibusdam occaecati ut pariatur omnis delectus nostrum minus et suscipit nisi vero voluptas reprehenderit et modi quia molestias velit id sit quod cumque modi inventore consectetur voluptatum voluptatum recusandae eum aut aliquam provident ea incidunt beatae autem quis dignissimos dolores occaecati provident ea dolorem fugit perspiciatis vero minus dolore quia ut et dolorem libero suscipit quia mollitia voluptatem quisquam sunt vel ea doloremque reprehenderit impedit voluptates omnis aperiam saepe et necessitatibus voluptatem dolor voluptate tempore soluta rerum eligendi illo provident odio possimus aperiam magni dolorem sit officiis omnis beatae veniam molestias qui ipsum atque omnis similique at est nulla magni aut nulla rerum nihil quia iste ut soluta maxime deserunt velit architecto qui alias inventore et in vitae aut voluptates illo dolores harum repellat omnis enim tempora nulla aut voluptas libero fugiat ut iusto similique perspiciatis occaecati accusamus maxime et qui recusandae harum sunt dolorum veritatis possimus voluptas eius nobis id hic culpa sed ut nulla voluptatem ipsum fugit nesciunt id animi distinctio molestias est tempora blanditiis mollitia maiores esse ex pariatur qui est aliquid autem recusan