INSERT INTO `course_news` VALUES ('608', '3', 'Ut nisi dolores assumenda quisquam dolorum.', 'Iste nisi magni delectus occaecati rem ipsum itaque esse et laboriosam accusamus iste enim ab eum distinctio consequuntur voluptatem nam quia sit distinctio cupiditate maxime voluptate corrupti nihil qui quo et ab officia ea deserunt ratione suscipit quisquam explicabo dolorum est laudantium eius fugit quia placeat autem adipisci nulla ipsum eum nulla blanditiis quo labore quis sit qui deleniti repellat aut delectus et voluptatem nulla temporibus id accusamus consequatur expedita dicta ut aspernatur fugit est consectetur deserunt consequatur cupiditate earum qui in est ut ipsum est consequatur non officiis eos optio perferendis et consequatur similique nemo quibusdam est error magnam et voluptatibus minus quisquam quia qui et odit eius consequatur impedit cum officia rerum perspiciatis sapiente corporis et molestias vitae itaque voluptatem est sed sequi consequatur veniam aspernatur magni nihil debitis deleniti qui minima nisi tempore aspernatur quasi possimus nihil id cupiditate eum dolorem omnis nihil occaecati doloribus inventore culpa omnis ipsum totam eius placeat quo consequatur fuga maxime tempore eos ea ut eveniet voluptate dolorem sint et rerum hic assumenda fugiat et quidem facere animi fugit deserunt necessitatibus libero sed explicabo unde quisquam modi aut tempore blanditiis itaque est aut consectetur dolor assumenda minus qui cum voluptatem ipsa debitis temporibus aliquid accusantium omnis reprehenderit porro amet ullam odio et quisquam ipsam similique suscipit repellat suscipit consequatur ipsam voluptas odit optio ad quo eius quasi animi et fuga qui voluptatem expedita magni.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('609', '5', 'Quo maiores et eum enim culpa.', 'Aut eos reprehenderit velit in quibusdam repellendus aspernatur numquam harum est quis molestiae eaque iure cumque maxime magni qui non vel consequatur ea commodi qui qui qui incidunt vel reiciendis culpa eligendi dolorem saepe ut esse voluptate sunt magni et amet repellat doloribus suscipit et maiores est voluptatem explicabo ut omnis commodi eaque consequatur cum quis at eum ea ratione doloremque aut tempore et sit ad eaque quisquam minima aliquam enim distinctio rem est unde pariatur velit ipsa qui ipsam est voluptatibus quia reiciendis unde sapiente qui aut aspernatur perferendis sit omnis voluptates eaque rerum ipsa incidunt et autem voluptas consequatur illum recusandae unde mollitia ea nisi ipsa tempore et et dolorum voluptatem a sit perferendis enim deserunt ullam vitae rerum et rerum qui magni et sit quia consequatur distinctio consequatur consequatur et assumenda ducimus ipsum rerum recusandae placeat iste repellat excepturi modi velit accusantium illum sapiente facilis eligendi sint quia excepturi quos eos ad dicta vel et non saepe eveniet earum autem magnam cupiditate quaerat esse ut provident harum voluptas quis eveniet et praesentium atque voluptatem impedit nisi placeat non delectus alias quisquam consequuntur distinctio qui rerum aut consequatur quae officiis debitis quis et ad id sit quia aliquam laborum nemo et dolores aut qui illo temporibus iure et corporis consequatur eveniet ipsum odit excepturi vel dolorem quia nulla architecto fugit in cum quis illo dolores debitis rerum nemo qui animi omnis at hic sunt sit ratione cupiditate ipsum sequi dolorem voluptas ullam recusandae consequatur dolorem vel voluptatum molestiae cupiditate sit non repellat velit eos debitis quod fugit dolorem vitae quis rerum consectetur eum sunt non iure ut rem et unde eligendi laborum corporis sit quia sit non vel aut ipsum quam aut dolore dolores adipisci culpa et reiciendis ipsum dolore po