INSERT INTO `course_news` VALUES ('610', '7', 'Harum occaecati aut odio mollitia blanditiis temporibus.', 'Doloremque perspiciatis ut adipisci veniam recusandae ad numquam ex nisi et quia quia est sint in ut quis quisquam beatae non voluptas qui est facilis similique soluta magnam quasi nulla exercitationem harum et aut temporibus ullam fugit totam dolores totam recusandae ex assumenda voluptatem reiciendis ex quasi dignissimos nobis error quas dignissimos rerum voluptatem dolorem blanditiis laborum asperiores voluptatibus necessitatibus sed itaque animi accusantium omnis similique voluptatem blanditiis ut aut quam neque sit eos perspiciatis eius facere repellendus ut ratione dolorum molestiae ullam facilis aspernatur omnis harum mollitia eligendi modi sit quia dolorum non ullam autem dicta distinctio fuga iusto rerum praesentium quisquam alias dolorem consequatur est et error sequi beatae sit quia voluptate ipsum quod qui ut rerum fugiat iste sit magnam similique excepturi voluptas perspiciatis laudantium enim aperiam accusantium voluptas aut ipsa facere dolorum quo sit dolores eligendi asperiores rerum excepturi minima ex explicabo dolor eaque sed praesentium id aut libero fuga ut eveniet corporis sequi sit suscipit laboriosam laboriosam illum minus eum perspiciatis et aspernatur non unde ad beatae ut ducimus nostrum dolore perferendis dignissimos nihil itaque recusandae illum occaecati fugiat pariatur inventore non dolor voluptas minus id dignissimos natus perspiciatis aut perspiciatis aspernatur est molestias ipsam ipsum laborum officiis explicabo et dolor quia voluptatem voluptatem praesentium est iusto aut quo autem dolor praesentium aut expedita doloremque sed enim quia animi amet id ut corrupti voluptas nihil hic qui aut unde illo sit aut suscipit doloribus pariatur tempora expedita et quae id est autem beatae est ut corrupti at voluptates.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('611', '4', 'Quis officia quaerat sapiente.', 'Id eos assumenda quia ipsum et et voluptas autem esse et nobis optio veritatis aut quia accusantium velit doloremque nostrum hic neque illo minima tempore cumque non porro sit impedit enim et nihil qui aut consectetur ex excepturi laudantium est rerum et est saepe harum deserunt natus quis quasi deleniti distinctio labore blanditiis aliquid sapiente eos dolor delectus minima reprehenderit maiores iure quibusdam similique distinctio exercitationem debitis possimus et autem maxime fugit sunt ea beatae similique totam impedit eius ipsam debitis omnis ratione sint vel consequatur quia velit autem architecto libero numquam sit ducimus eum nam similique facilis enim illo deserunt temporibus harum pariatur voluptatem nemo consequatur asperiores voluptate aut aut minima facilis excepturi labore magnam eum reiciendis totam voluptatem voluptas quia et illum quidem ipsa iusto nemo fugiat ut sit adipisci reiciendis totam nisi cumque neque id et et eaque sapiente asperiores corrupti velit vel atque quis et ut rerum velit vel tenetur eius molestiae quis iste enim ratione cumque distinctio blanditiis temporibus quidem accusamus quos ducimus non voluptatem in qui est voluptatum placeat et sit aut qui soluta repellendus cum aut alias natus architecto enim voluptatem similique dolorum culpa voluptate omnis assumenda qui dicta exercitationem voluptatem dolores repellendus non quisquam officia voluptatem saepe distinctio quaerat aut reiciendis officia voluptate cupiditate ab quo fugit atque voluptatibus consequatur nam incidunt dolores sunt unde est eos iure ut suscipit corporis fuga ea iure unde nisi autem beatae dolores quidem molestias incidunt enim distinctio molestiae deleniti iusto esse officiis modi ullam quibusdam ea asperiores recusandae nesciunt esse non nesciunt id odit voluptates voluptatibus excepturi ut consequatur doloremque maxime nobis qui id ut rem iste et debitis voluptates doloribus rei