INSERT INTO `course_news` VALUES ('612', '8', 'Sapiente dolore nesciunt molestias iure exercitationem in.', 'Unde velit officiis error porro sint ut atque dolor consequuntur est hic et ut delectus non in dolor illum aut iusto qui similique eius officia dicta doloremque qui ut dolorem dolorem officiis dolor nulla fugiat perspiciatis ut cum ipsam tempore libero dolore aut et et occaecati voluptas eos minus necessitatibus quam rem minima magnam quos enim ut et velit beatae et aliquam facilis reiciendis qui quam laboriosam sint eos explicabo voluptatem qui quisquam fugit aperiam quia eligendi fugiat dicta est id et excepturi quos et eos voluptatibus distinctio cumque odit vero odit dolor modi qui minima sit sed aut aut quasi commodi commodi perferendis praesentium officia consequuntur nam maiores nam esse quia odio molestiae ullam praesentium voluptatum placeat saepe et molestiae sed exercitationem voluptatem sit vitae dolorum quia quaerat dolor velit illo omnis magnam commodi sapiente sint ut laborum voluptas aut est est amet et ratione quos incidunt officiis in rerum aspernatur reiciendis non tempore repellendus explicabo consequuntur voluptas vel sit omnis nisi accusamus a optio distinctio est rerum et quasi debitis molestiae molestiae quibusdam et possimus deserunt repellendus et sint veniam quibusdam voluptas optio et in ut ex in reiciendis porro maxime laborum soluta quis iusto ut est perferendis quibusdam repellat totam natus natus omnis optio dolores et iure non praesentium ipsum unde omnis necessitatibus dolores ea in iste et laboriosam laborum et soluta animi cumque aliquid doloremque facilis nemo ut optio omnis ullam ipsa labore impedit corporis est id perferendis sapiente et commodi eaque rerum quaerat magnam et nesciunt sit quo nobis veritatis officia tempore id similique autem officiis excepturi et facere quas doloremque nisi voluptas natus tenetur at recusandae ducimus quibusdam minus odio aut laudantium quia qui ad assumenda non asperiores reprehenderit vel facilis perspiciatis ratione iste nam est quod doloremque odit et qui pariatur tempora molestias et aut et deleniti est ut ut totam qui deserunt saepe quae consequatur quos eos corrupti nesciunt blanditiis est est totam iure temporibus molestias et exercitationem aperiam a ut cumque animi commodi quia sunt qui id beatae officiis quo reiciendis fuga ipsum sit voluptatum ullam iure quia dolor non illo dolor dignissimos rerum dolorem esse doloremque ut voluptatum earum dolor est et nesciunt quia consequatur dolores omnis velit recusandae voluptas asperiores quia nostrum dolorum a et suscipit dolores est accusamus consequatur ipsa.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('613', '2', 'Dolorum suscipit ea vel voluptates ea voluptas.', 'Dolorum similique dignissimos rerum blanditiis perspiciatis temporibus hic soluta est est odio non labore sunt laudantium quae molestiae corrupti iure modi repudiandae ipsum totam quidem sequi sint placeat repellat saepe earum eos rem tempore iusto quasi fugiat et qui ut architecto vel vel asperiores aperiam quaerat autem amet vitae ab aut maxime qui qui est iusto ratione suscipit in possimus sit laboriosam porro reprehenderit facere sapiente explicabo dolorem quibusdam est est magni perferendis similique quisquam odio in suscipit et officia voluptates repellendus laudantium optio ut accusamus doloremque sed et nobis repellendus iure velit autem harum distinctio omnis nulla aut est magnam sunt esse aut quas consequuntur sit numquam repellendus est quidem ullam veritatis cum blanditiis veniam consequuntur rem est ut placeat praesentium voluptatem perspiciatis aut inventore dolor quas culpa dolores maxime ipsum sunt sed praesentium est dolores nam non culpa voluptatum omnis aperiam voluptas deserunt laudantium aliquam est explicabo autem quia voluptas nihil saepe cumque maiores doloribus necessitatibus molestiae at qui aut eius ratione quod repellat rem vero illo autem eos eius accusantium quaerat veniam et nemo veniam numquam iste explicabo dolor rerum sequi voluptatem error ipsam optio laboriosam accusamus sed sed illum qui dolor quia inventore doloremque error amet ipsum veniam asperiores nobis reprehenderit ab reprehenderit est dolores omnis voluptas vitae voluptatum dolor consequatur facilis corrupti aliquid animi corrupti modi perferendis aliquam voluptates at ipsa velit commodi consequatur minima quod et vel qui reprehenderit sapiente similique eos assumenda ut incidunt ut deserunt non eum repellendus ipsum voluptate et aut quo voluptate qui maxime itaque vero consectetur voluptatum nemo eligendi voluptatum aut.', '0', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('614', '5', 'Distinctio sit veniam quos voluptas modi eos.', 'Rem adipisci ut repellendus exercitationem consequuntur autem blanditiis modi suscipit veniam possimus recusandae repudiandae quos dolores ut facere voluptatem excepturi dignissimos accusamus tenetur tempore quo similique itaque ut architecto repellendus fugiat saepe earum accusamus est maxime eius ipsa eligendi saepe ad consequatur hic omnis quas hic voluptatibus aut delectus tenetur illo eveniet sapiente incidunt recusandae sed enim velit officiis illo nemo est architecto incidunt reprehenderit excepturi asperiores quaerat suscipit ea et ullam esse possimus magnam voluptas nihil in id deleniti voluptate voluptatibus et corrupti enim fuga sit saepe ut architecto velit et qui et rerum et esse omnis ipsum ratione quas est dolores qui sequi dolor quo cumque exercitationem doloremque repellendus cumque repellendus et qui fugiat culpa dolor voluptas laudantium cupiditate maxime consequatur nobis sunt quis porro vel est sed similique perferendis est expedita eius nemo dolores veritatis ratione et iusto eius nihil mollitia reiciendis sit porro quaerat iste pariatur eligendi esse laboriosam vel officia cupiditate dignissimos et eaque sed consectetur ut iusto voluptatem odit dolores quia quia error praesentium illum debitis soluta at labore quidem sint consequatur nihil ab deserunt nisi sunt earum labore a odit dolores quia suscipit quibusdam nobis asperiores consectetur reiciendis vero est aut repellat assumenda aliquam nihil voluptates esse impedit possimus praesentium quo repellat aperiam reprehenderit tempora molestias cum consequuntur ipsum ut sapiente a rem et tempore harum et consectetur laboriosam earum laborum cum quod quod non architecto at aliquid nihil aliquam laborum quisquam nihil officia reiciendis aperiam est hic harum laboriosam quis nisi ut suscipit facere suscipit maiores sit et error eos blanditiis molestiae fugit ut veritatis quibusdam sed exercitationem nisi