INSERT INTO `course_news` VALUES ('615', '3', 'Non rerum quas minus ex.', 'Numquam omnis facere deleniti assumenda aliquid omnis dolor ut quasi qui odit eveniet iusto laboriosam at est ut consequatur quod occaecati exercitationem voluptatem incidunt omnis esse itaque inventore aut enim hic voluptatum voluptatibus quod quasi explicabo veniam aperiam occaecati numquam qui excepturi possimus et accusantium autem dolores quasi et voluptatem placeat repellat perferendis rem nihil sunt perspiciatis odio quam autem ipsam ipsum molestiae dicta at et ut non sed et est non rerum ut vero voluptatem et esse amet nobis sit reprehenderit minus asperiores est quo aliquam error fugiat sit et corporis repudiandae temporibus nihil eum laborum consequuntur animi similique qui minima perferendis officiis repudiandae at aut impedit soluta unde optio ex maxime facere nobis culpa magnam commodi aspernatur enim distinctio cumque illum laudantium non ab cupiditate iste eos nisi eligendi illum officia et necessitatibus laborum voluptatibus odio laudantium mollitia dolores hic quidem quisquam qui deserunt vero sed error qui facere quo reiciendis cum a necessitatibus nulla officiis sunt provident necessitatibus consectetur eum dicta ullam sed ab et omnis rerum voluptates consequuntur enim in quod incidunt temporibus doloremque voluptatem autem similique quos ad dolores cumque facere et doloribus sit qui quia delectus corporis possimus ut eligendi.', '0', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('616', '3', 'Et ducimus in repellendus cum cum.', 'Placeat aliquid qui quia suscipit deleniti molestiae alias eos numquam iste quo placeat est nemo voluptatem ullam omnis fuga vero est odio nostrum harum voluptas sed hic officia optio sed ullam itaque quam voluptatibus qui sit est fuga ex dolores doloribus sit nemo nihil voluptatem distinctio qui deserunt omnis et nulla incidunt et expedita sit porro aut nisi porro atque in provident nihil amet quia inventore autem voluptatem et autem et commodi aliquam eveniet inventore atque facere provident voluptas commodi commodi aperiam voluptatibus quo dolor possimus sunt a illum ad rerum voluptatem voluptatem voluptatem eaque aliquid ullam quia tenetur similique quis iste sed eos sit recusandae molestiae dolorem a accusamus non consequatur aut ut corrupti aut aut molestiae assumenda odio ut doloremque iusto odit sit accusantium quos doloribus id porro voluptatem enim dolor officiis et optio blanditiis in consequuntur tenetur consequatur minima ipsum id veniam quod inventore doloribus sunt fuga rerum ab cupiditate sed ut magnam ad ipsum molestiae voluptatem assumenda rerum ipsum ipsam molestiae mollitia velit exercitationem voluptate excepturi saepe occaecati ullam rem voluptatem ea aliquam expedita nesciunt accusantium libero ut ut harum eos omnis aliquid impedit eos repellat labore omnis unde libero qui quaerat modi dolor iusto rerum nulla voluptas reiciendis itaque reiciendis amet qui nulla dolore alias ipsa itaque consequatur quis a nihil qui atque voluptates suscipit voluptatem velit aliquam perspiciatis ab perferendis mollitia nisi velit voluptas neque tempore hic aperiam ut ad hic alias corrupti dignissimos rerum voluptatem velit corporis dignissimos harum id et inventore assumenda qui autem fuga ad deserunt enim et qui et omnis praesentium et quasi consequatur sunt et sit quia ut tempore optio sed non molestias odio sequi nihil voluptas eligendi dolorem sit voluptas expedita velit eos