INSERT INTO `course_news` VALUES ('617', '4', 'Ex corrupti amet aut dignissimos fuga sunt.', 'Voluptate quae fugit commodi quidem ut similique quo sapiente dolorum non in optio sit corrupti cupiditate dolore ut omnis vel laudantium quos veritatis earum dolorem veniam molestiae ad id velit qui ratione corrupti dolores laborum nostrum ullam molestias veniam sed soluta enim omnis pariatur voluptatum adipisci occaecati excepturi maxime magni quo culpa voluptatem fuga placeat dolorem porro quia expedita consequatur odit recusandae sunt natus voluptas rerum sed quia ut ut rerum dolor velit fugiat molestiae magnam assumenda necessitatibus id repudiandae et dolorem recusandae cum totam qui eius ipsa sint fugiat ab dignissimos sint rerum est molestiae voluptate architecto consectetur mollitia sit recusandae enim aliquid esse id non est nisi non consequatur corporis ab quia molestiae repellendus magni officia praesentium modi ipsa sapiente dignissimos animi qui esse consequatur voluptate voluptas voluptatum aliquam dolor exercitationem ut laudantium ut iste ut fuga ad qui et et ut voluptatem ut veritatis delectus et similique soluta quam sit corrupti quo optio aut voluptates aut et ipsum quo repellat sit facilis sunt eius enim qui quo nobis molestias error nostrum voluptates non recusandae cupiditate ad rem et qui ad tempora sequi beatae autem quibusdam et qui mollitia fugit repudiandae ab ratione voluptatum mollitia minus totam velit commodi non aut doloribus aperiam aut laborum eius a quisquam labore dolor aliquid laudantium reiciendis nostrum pariatur commodi eos soluta vel nihil velit voluptatibus mollitia aspernatur id eum voluptatibus quasi laudantium nulla doloremque velit sint autem illo rerum eligendi et nulla quia nemo optio et neque sed et aut qui similique iure assumenda sit exercitationem dignissimos ut in hic distinctio et accusantium quidem quis aut dolore sunt quae vel ut qui voluptatum illo culpa rerum necessitatibus molestias nostrum in voluptate quo aut expedita et culpa ipsa deserunt in vel corrupti eos alias amet corporis libero voluptas rerum placeat nemo dolores iusto autem quo illum neque consequuntur porro reprehenderit id quos fugit quis est officiis in exercitationem quidem error quas repellat modi molestiae eum tempore fugiat voluptas sit reprehenderit aut vero numquam aut laborum eaque quaerat tempora dolores quaerat est vel quibusdam qui et sed non id quia est sint sint molestiae sit quia quasi et est sed nam quia voluptas vitae ut consequatur distinctio tempore molestiae consectetur.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('618', '7', 'Ab dolor ut dolorem id nemo voluptates facere.', 'Dignissimos reiciendis vitae porro ut veniam dolor qui nihil labore delectus omnis necessitatibus officia dignissimos et error placeat necessitatibus officia quos libero nihil qui dolorum pariatur ut nihil dolores occaecati quia aliquam magni necessitatibus modi rerum amet praesentium quos quasi iure sequi illum hic blanditiis excepturi possimus qui debitis voluptatem et deleniti et dolore mollitia suscipit temporibus est excepturi impedit voluptatem quos et est sequi ut quibusdam enim nemo quidem consequuntur id et dolorum dolores sequi magni et modi nulla enim non architecto error voluptates veritatis optio dolores quis qui consequatur non ab aliquid laboriosam maiores natus voluptatem voluptate doloremque culpa occaecati labore eveniet porro in placeat culpa natus quia unde quia ea provident in id delectus voluptas nisi nisi nihil autem ea facere eum molestiae voluptatibus similique et ipsam ut eaque et quia cumque iste animi nostrum quas eum molestias labore quo est nam eum commodi impedit corrupti sint quo et velit ducimus qui non sed deleniti a autem odio fuga dolorem iure provident et sapiente autem velit sed eligendi vitae a incidunt sit dolorum inventore velit consequatur dignissimos earum et odit odit qui sit rerum ipsam praesentium laboriosam illo aut non qui id saepe sunt vitae dolores natus enim voluptas nam vel accusantium qui quibusdam accusantium eum corporis non sunt sed ad ut vel saepe nisi aut in numquam saepe numquam perspiciatis omnis expedita sunt magnam doloremque fugiat et aliquid dolore hic ullam nam sit corporis eos rem aut aut similique vero voluptatem qui temporibus neque quae quasi aut consequatur numquam sed nihil dolore quo omnis qui rerum numquam eaque hic adipisci pariatur veniam dolore dolorem deleniti dignissimos voluptates blanditiis voluptatem explicabo et voluptates qui inventore debitis totam aut et sunt aut quaerat voluptas accusamus aut sit pariatur aut sit alias eum eum nam accusantium in ut dolore minima excepturi beatae aut ut perferendis ex tempore qui in.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('619', '2', 'Dolorum voluptatem asperiores est sint amet recusandae.', 'Non quas et laboriosam ipsam quaerat qui eum voluptatem pariatur omnis quibusdam doloremque nam qui repellat sit est illo voluptas aut recusandae mollitia numquam consequatur libero distinctio odit enim dolorem iure itaque et in reiciendis nostrum cumque laboriosam ad illo facere a aliquam enim ut necessitatibus voluptas ut praesentium dicta voluptates eius mollitia recusandae assumenda officiis voluptatem modi ut atque ducimus reprehenderit consequatur magnam natus veniam et itaque expedita eos voluptatum consequatur omnis quod molestiae quas tempora voluptate qui quibusdam id laboriosam laudantium deleniti beatae voluptas reprehenderit distinctio animi perferendis eos officiis dolorum eligendi qui saepe magnam ex ut fugiat sit illo fugit occaecati enim blanditiis amet occaecati laboriosam error qui velit vel explicabo quo quia asperiores aliquam consequatur et optio repudiandae quibusdam natus officia recusandae illo sit quae corporis maiores omnis fugit alias accusantium et maxime nulla dolore debitis quod a reprehenderit autem quisquam et deleniti aliquam reprehenderit perferendis sit iure placeat repudiandae vel dolor et voluptatibus quo quis dolorem ut in dolore praesentium aliquid et eius mollitia quo eius est hic qui est et voluptas nesciunt quaerat accusantium voluptas non nesciunt quos tenetur eum dolores aut rerum esse saepe harum et impedit culpa necessitatibus incidunt et blanditiis sint odio earum ut earum corrupti consequatur atque non magni enim ipsum et suscipit omnis vitae tempore ratione dicta repellendus suscipit autem corrupti eos facere sunt necessitatibus sed repellendus quia.', '1', '2017-05-02 22:59:20', '2017-05-02 22:59:20');
INSERT INTO `course_news` VALUES ('620', '1', 'Consequatur consequatur rerum sunt adipisci aut aperiam officiis.', 'Atque porro iste neque et odit laboriosam est ea eaque dolor aliquam consequatur ratione animi pariatur velit officia excepturi quo quisquam ut saepe consequatur dolorem nihil placeat non ut tempora id ab et dolorem quia ex asperiores nihil a amet libero officiis est maxime porro architecto praesentium animi fugit dolore quis sint et at libero nobis voluptatem vero sed quos rerum eveniet repellendus quas iure et nam impedit alias aut voluptates omnis dolores et quam occaecati molestiae cum quia delectus vero officia minima ab beatae ea non inventore omnis et quo eum ea modi in soluta aut totam vitae a blanditiis sit cupiditate ea ut enim id suscipit sit cupiditate temporibus animi labore et omnis amet et non ut cum omnis omnis ut nobis voluptatibus et consequuntur qui molestiae voluptatum similique laboriosam suscipit explicabo fuga quidem cumque est autem quia id tenetur distinctio pariatur cumque ut cupiditate ut et non qui minima ut qui recusandae voluptatibus provident ea repudiandae quasi iure quia eos iusto ut ut ipsa rerum architecto qui eius ratione ullam animi maxime aut qui occaecati quidem quisquam quaerat cupiditate ut dolorem sint quia aut temporibus consequatur iusto iure non temporibus ipsum sed aut laboriosam voluptatem commodi culpa doloribus eos qui accusantium esse sit vel velit cupiditate rerum nesciunt in soluta aliquam qui accusamus cupiditate qui ex quod.', '0', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('621', '2', 'Neque quam dolores dolorem sit pariatur in.', 'Doloremque minima minus repellat ullam necessitatibus et et quidem eius reprehenderit repellendus non eum voluptatibus doloremque et vel non corporis rem numquam voluptatibus explicabo id voluptatem veritatis esse cupiditate et ipsam et aut et vel commodi laborum a ea et et tenetur rerum inventore et repudiandae molestiae nesciunt doloremque laudantium illum voluptas est natus facere non est voluptatum nam est consequuntur et error delectus praesentium repellat iusto placeat quia cupiditate qui fugiat dolorem sed sunt amet ea corrupti repellendus reiciendis voluptates consequuntur cumque sequi necessitatibus consequatur est incidunt culpa est eius repellat similique itaque magni a ducimus in reiciendis velit dolor itaque natus aut et quaerat quia quo odio quia velit eum ea beatae iusto rem ut ea molestiae dolor sequi in laboriosam eum ab officiis sunt accusantium quia ut omnis architecto similique qui neque excepturi numquam ut velit similique rerum non est ducimus itaque quidem nisi reprehenderit quis sunt et nulla necessitatibus quas praesentium quas illo et voluptas non maiores cupiditate esse enim nostrum eum hic facere et itaque ea deserunt aut qui sit consequatur et illum debitis illo est tempore aliquid eos mollitia repellendus ut eos eligendi consequatur rerum perspiciatis odio quae sed ratione excepturi ut quo accusantium inventore eveniet provident et distinctio et veritatis et eveniet molestias aperiam magnam omnis sequi velit ipsam alias facilis sed est tenetur nisi tempora recusandae eaque voluptatem rerum aut dolores qui aut nemo veniam maxime quos accusamus iure provident assumenda tempora quidem quidem placeat occaecati consequatur corporis cumque omnis alias enim id tenetur incidunt et eveniet nobis nesciunt iste nemo.', '1', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('622', '9', 'At earum quos debitis nostrum est.', 'Id adipisci quaerat quia corporis reiciendis sed enim nisi est ut occaecati consequatur provident cumque ut autem nihil vel ipsam non ut pariatur nihil veniam at in qui omnis et in assumenda est non sed quidem et ut et debitis non aut aut omnis quidem maiores sed minus veritatis natus repellat hic qui quia fugiat nulla excepturi voluptas illum non nesciunt quo necessitatibus tempora aut ullam vero accusantium eum libero dolorem beatae qui aut assumenda distinctio atque accusamus commodi rerum voluptatibus occaecati ut maxime adipisci cupiditate vel quia nulla ullam inventore dolor doloribus ipsam et aspernatur enim velit repudiandae eveniet et natus ea vitae non sed consequuntur expedita repellendus alias eum laudantium explicabo et adipisci dolorem id ea labore quia nam aut exercitationem perspiciatis nemo est pariatur expedita enim voluptatem hic perferendis nostrum aperiam sunt quia libero accusamus tenetur autem velit aspernatur aut atque quis est repudiandae architecto libero et adipisci voluptas molestiae corporis ea expedita occaecati accusamus commodi at rerum vitae voluptates fuga asperiores id corrupti et velit sunt magni eaque error fuga beatae dolores voluptas esse dolor error voluptas id quo saepe ut cum quasi minima quam commodi sed corporis cum et omnis et est autem autem voluptatem ullam eius nostrum maxime dolores est veritatis perferendis dolor quia magni incidunt et aliquid consequuntur non quidem ipsum eos sed qui perferendis laudantium qui porro quo est debitis sunt placeat id animi voluptatem quia ea cumque ullam excepturi aut at eos deserunt quibusdam velit et necessitatibus blanditiis consequatur enim quidem quibusdam qui quis ut dolor qui qui ut repellendus aut illo qui pariatur cumque nemo ut quis ab quisquam nemo minima veritatis vero aperiam eligendi natus id ratione adipisci nulla nam eos aut omnis accusamus deleniti non qui iure laudantium alias repellendus tenetur saepe pariatur possimus sed eum maiores recusandae autem nulla ab non animi praesentium magnam laboriosam id atque ea et eveniet labore qui odit facere sit totam odio nihil et maxime veritatis ex ratione unde et officia et delectus iste omnis pariatur architecto qui quia et iure ea quia tempora officiis labore voluptas dolor repellat ullam quia delectus ut facere voluptatem aliquid porro quaerat qui error earum hic eum doloribus quaerat officiis a ex illo officiis dolores saepe perferendis assumenda excepturi eos possimus similique amet saepe nemo sit et harum dicta totam itaque optio modi vero omnis rerum quia itaque nostrum non sit culpa sit quod autem laboriosam quia magnam nihil libero optio quaerat voluptatem tempora consequatur.', '1', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('623', '8', 'Facilis id vero quisquam ab perferendis eos et.', 'Dolor quisquam assumenda earum est ut itaque ipsum ut vero doloremque cumque voluptatum dolor incidunt labore explicabo asperiores qui et sint beatae laborum ducimus et dolorum rem modi harum saepe a deserunt culpa hic et nulla nesciunt eius voluptatem repellat error sint nesciunt distinctio exercitationem id sint expedita iure cumque quod quo distinctio at ut et velit fugiat qui id qui officia qui qui ut doloremque porro neque non repellendus est qui cumque recusandae rerum facilis saepe fuga dolorem laboriosam accusamus consequatur voluptates accusamus qui tempore cumque consectetur cum doloremque fuga doloribus nulla qui omnis minima est sequi minus ducimus inventore qui voluptas modi sunt facere ratione dolorum iste omnis eos consequuntur quam aliquid rerum minima enim est vel corrupti iste veritatis blanditiis a sunt numquam vitae omnis ut reprehenderit eveniet minus et earum quia et eum vel ut exercitationem voluptas sed voluptas nemo et commodi et voluptatem distinctio minus asperiores ut et asperiores aliquid aliquam sunt autem nulla repellat velit aliquid qui placeat sit eum praesentium in accusamus eum praesentium ducimus rerum sequi voluptas ut et aperiam voluptatem commodi iusto doloremque corrupti perferendis magnam reiciendis magnam adipisci qui est voluptas quis iusto dolorum ratione fugiat amet quidem explicabo optio ullam similique necessitatibus amet sed sint quia quia tenetur similique voluptate reiciendis esse assumenda.', '0', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('624', '8', 'Omnis fuga ullam sed tenetur praesentium.', 'Omnis dolorem aspernatur id rerum ut porro quia et id dolores eveniet accusantium cupiditate et possimus accusamus quis nesciunt odio vel officia laboriosam quasi ipsum corporis ut fuga exercitationem adipisci aut non debitis tempora asperiores quo odit ipsam explicabo est ut quibusdam aspernatur veniam dolorem consequatur laudantium impedit alias cum accusantium nam quia fugiat et rem quo omnis qui distinctio dolor praesentium pariatur ducimus ipsam alias et labore aspernatur ut consectetur quam ut ipsum velit similique totam est perspiciatis praesentium dolorem fuga error at reiciendis exercitationem eum ullam temporibus qui maxime enim a optio quia reiciendis rem incidunt ut vel ea qui nesciunt quod aut quaerat deleniti aut accusantium voluptas voluptas reprehenderit rerum facilis quia voluptates voluptas beatae similique in vel voluptatem dolorum possimus voluptatem hic ut sit at ut saepe exercitationem et qui at excepturi nesciunt amet numquam saepe porro libero nihil iste ex id consequatur autem et dolorum veniam dolore sequi minus voluptatibus fuga et nisi eligendi fugiat sapiente nobis sed error explicabo sit nihil illum excepturi tenetur culpa aliquid eius deserunt modi et aut rerum in beatae et ut minima aut est possimus sunt adipisci magni delectus molestiae amet vel animi veritatis rerum mollitia quaerat quis a illum dolores voluptas reprehenderit rerum quo repellendus iusto alias veniam voluptate recusandae dolor in modi voluptatem dolores neque in laborum ratione corporis corrupti autem possimus rerum voluptatem consequatur iure nesciunt quis eum iusto possimus rerum nam quo sit.', '0', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('625', '2', 'Qui placeat laboriosam provident.', 'Et sed molestiae rerum tenetur ipsam repellat repellendus accusantium veniam sint ut dolor delectus quasi magni blanditiis repudiandae tempore dolorem corrupti quidem et voluptas a quis vitae necessitatibus quas rerum eius facere tempore aperiam aut perferendis ad quae facere eaque dolor nihil molestiae ipsa voluptatem quis delectus optio sint et dolores corrupti quisquam eum perferendis vero laudantium delectus non et nemo voluptatem est veniam eveniet fuga magni repellat quos sed placeat nostrum deserunt at quam voluptatem animi minus est consectetur doloremque vel qui optio magnam vero quidem cupiditate doloremque non qui omnis est qui ullam et enim et excepturi dolorem hic porro et repudiandae labore saepe odio hic architecto rerum temporibus cum natus sit quisquam rerum et officia sed totam sint sed animi dolor aut quo dolores sint et qui eius impedit perferendis vitae ea qui sint consectetur asperiores quaerat minus voluptatem architecto temporibus vitae dolor earum expedita corporis quia et amet qui iusto sed quasi voluptatibus quo repudiandae assumenda modi vel sit rerum labore repudiandae et laboriosam inventore eum vel vel dolores dolorem eligendi ut enim ipsam voluptates rerum doloribus aut quisquam ut est quo recusandae perspiciatis quibusdam sed qui nisi labore fugiat ut incidunt exercitationem dolorum eos ipsum ut quasi fugit quae rem itaque enim quidem voluptatem et suscipit amet ut ducimus in libero iure ea rem ab qui repudiandae praesentium atque ratione enim in quis dolor qui excepturi quia labore et sed aliquam qui dolorem reprehenderit voluptas tempora aut voluptatibus voluptas fugit corporis est ipsam ipsa ducimus in et iste.', '1', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('626', '4', 'Accusantium repellat maiores omnis dolores.', 'Sunt id dolore nostrum consectetur laboriosam eaque voluptatem quidem illum et et porro et id labore non assumenda architecto cumque neque aspernatur qui iure vitae inventore sequi facere vitae repudiandae expedita saepe harum autem autem in qui quia molestiae autem dolorum in fugit nostrum quasi quasi magni ratione laboriosam quo sed ab dolor pariatur exercitationem debitis reiciendis sed quos voluptatem natus cumque culpa dolorem aliquid et delectus optio voluptatem labore magnam quo nobis ea provident consequatur sunt minima minima labore corrupti placeat tempora deleniti rerum officia quia atque perspiciatis veniam non accusamus blanditiis et et perferendis quasi voluptate odit et facere ea tempore voluptatem sit vero qui ipsam rerum fugit commodi corporis possimus nisi et nemo in asperiores accusantium nesciunt vitae commodi perferendis quo quasi sapiente unde neque et id nobis quibusdam dolore dolor et adipisci vel aut commodi natus consequatur praesentium sed provident dicta necessitatibus sit aliquid tenetur at debitis reprehenderit quo dolores dolores sint id dolore maiores accusamus totam ut reiciendis praesentium voluptas quia qui est aut veritatis aspernatur veniam error nobis nisi fuga beatae eius consequuntur dignissimos autem veritatis qui minus vel ut quam tempora cumque explicabo quidem voluptatum facilis dolore error asperiores soluta itaque libero fuga qui quod rerum laudantium assumenda magni officia quaerat beatae commodi in doloribus temporibus sapiente qui repudiandae autem aspernatur dolores aliquid est nobis nemo voluptatem perspiciatis voluptatem inventore aut est esse nam aliquid id repellendus saepe expedita cumque aut libero architecto reiciendis aut dolores enim et beatae eveniet eveniet quia corporis.', '1', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('627', '7', 'Quia qui id quis molestiae et illo voluptas tempore.', 'Veniam in sed velit reiciendis reprehenderit omnis velit officiis et esse exercitationem qui laborum et soluta sit est earum ea quia voluptatem quia distinctio velit molestiae ea similique et perferendis repellendus qui tempore et praesentium ut ea quia sunt officiis soluta aut consectetur quo debitis voluptatem corporis non eligendi porro voluptas omnis sed quidem earum et fugiat sequi sed nihil natus officia rerum numquam accusantium mollitia ut et dolorum autem consectetur impedit quia dicta amet aut dolor illo alias et velit itaque possimus est perferendis non blanditiis hic nesciunt et quas minima dolore est cupiditate dicta ea officia quis molestias commodi explicabo labore quaerat quisquam et sit qui autem qui nesciunt repellendus doloribus corporis neque in necessitatibus eum omnis assumenda soluta odio ut autem quas omnis eligendi culpa sit ipsam nemo expedita qui similique voluptatibus quod voluptatem et possimus velit qui quia quae ut recusandae amet quae sit est corporis a sed amet quia et vero ipsam exercitationem eum voluptatem aperiam tempora cumque voluptas aspernatur architecto ullam iure sit soluta quos quo distinctio qui eum dolorum ipsam sint voluptatem provident est molestiae sunt odit vitae dolores et dolor occaecati facilis qui nulla eligendi dolorum eius modi nihil ad est est esse cupiditate deserunt repudiandae sapiente corporis nostrum quia est est unde exercitationem aut itaque alias distinctio autem quis labore saepe cumque similique est non sit aliquam quia molestias in reiciendis soluta at perspiciatis dolores possimus.', '0', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('628', '7', 'Quod ut quia praesentium ea quos expedita.', 'Ut molestias possimus quia facilis ipsam unde voluptas porro ut est odit nobis aliquid nemo omnis voluptatem est quae qui blanditiis fugit earum autem qui excepturi ducimus dolores iure non harum ea quis ad illum qui sunt mollitia ullam voluptatem et est quia incidunt excepturi harum eaque quo consequuntur est est deleniti animi corporis reiciendis rem culpa aut eum sunt ipsam veritatis aspernatur distinctio voluptatem quas sint nostrum aperiam soluta velit voluptas aliquam minus et qui aut corporis impedit nemo ipsam sed soluta et quasi pariatur non non quas quam rem eveniet aut amet tenetur sit maxime ad deleniti ratione est numquam illum nihil nemo est ipsam nam maiores at ut facere atque aliquam rerum ut quia aut ut reprehenderit corporis voluptas dignissimos ab laboriosam autem at id sit atque et sit et quia qui enim quis dolorem exercitationem illum numquam excepturi pariatur iusto voluptas voluptate voluptatem nulla voluptatem rerum magnam veritatis nihil enim ab esse facilis sit suscipit ad quod molestiae dolorem nulla ut libero aut et sit et in quod ex et quia officia optio dolor voluptatem a consectetur facilis illum occaecati ut minus sunt labore occaecati expedita sed officia saepe et suscipit dicta quasi provident et voluptas vel natus ut ipsam atque mollitia aspernatur provident nam asperiores quam aut facere qui molestias odit est enim quisquam reprehenderit quam qui quo consectetur expedita cumque ad laudantium aspernatur velit et officiis fuga et dolore architecto vitae eius quidem aut voluptatem sunt molestiae illum dolore exercitationem laudantium velit labore sit omnis alias vitae delectus sequi animi consequatur sunt reiciendis sunt neque laboriosam saepe eveniet ab exercitationem atque quasi sunt consequuntur voluptas id et ut ullam odio odio est aliquid minus qui in necessitatibus voluptatum dolor corrupti a quod dolorum molestiae non voluptas veniam et sequi maiores in assumenda eaque eos ut dicta voluptatem eum qui dicta molestias omnis quae cumque voluptatem ex ut animi asperiores perferendis modi sed sit totam architecto ut suscipit est non enim hic numquam et vel qui consequatur velit odit enim et dolor amet dolorem ut qui cumque eum corporis cupiditate eos sed aspernatur doloremque.', '0', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('629', '1', 'Et quas quisquam maxime eligendi recusandae omnis.', 'Autem alias tempore eveniet et eum excepturi nihil libero dolores et voluptas et fugit aut occaecati officia magni adipisci dicta quas laboriosam aut repellendus aut voluptatum ut aut blanditiis exercitationem provident sed ut nihil eaque et ea blanditiis omnis alias temporibus in qui omnis similique similique quisquam sunt consequuntur sit fugit et quidem et eaque nihil placeat incidunt qui deserunt mollitia eaque unde perferendis eveniet cupiditate voluptatem quo et quia reiciendis doloremque repudiandae distinctio inventore exercitationem illum pariatur eum distinctio dolores ea qui quidem natus quia voluptates dolorem quis expedita debitis voluptatibus quia eius est ut aspernatur dolorem quisquam tempore et nihil cupiditate ut perspiciatis et nisi praesentium facilis non et eveniet ab ad sint qui recusandae non mollitia quia iure quia architecto doloribus maiores sed soluta praesentium voluptates voluptate ut et voluptatem et laborum eaque asperiores consequatur quia autem maiores a qui velit autem iure debitis distinctio quam praesentium eos quos et omnis et sunt itaque voluptatem ad modi quos ipsum molestiae ut aut quis autem similique sint quod dolorum ratione enim odit molestiae sunt eveniet ut consequuntur et mollitia ut cum est commodi ratione et nostrum explicabo deserunt voluptas rerum delectus consequatur numquam voluptate distinctio non aut.', '0', '2017-05-02 22:59:21', '2017-05-02 22:59:21');
INSERT INTO `course_news` VALUES ('630', '1', 'Nostrum magnam et non porro sunt quia.', 'Alias dolor ut id iste et qui est similique asperiores et et enim nesciunt minus maiores et culpa illo possimus qui harum aut quidem quas in sit voluptatem delectus perferendis exercitationem repudiandae rerum quam expedita vitae vel mollitia sapiente ducimus laboriosam accusantium deleniti architecto officiis in amet nostrum maiores numquam culpa natus quia impedit aut totam ea ab eius nemo asperiores temporibus est consequatur ullam ipsum ut vitae ex minus veniam ut quidem nihil libero officia quia iste voluptatum et rem vitae facere maxime ratione reprehenderit porro ut et tempora et non iure sit adipisci iure aperiam voluptas fuga natus nesciunt corrupti ad explicabo sapiente officia veniam et eligendi qui voluptatem nostrum inventore minus dolor nihil quis fuga incidunt dolore quo dolorem necessitatibus quaerat velit voluptas voluptate soluta harum sit consequatur id qui eius iure eum aliquid eos quis ducimus odit ut modi culpa aperiam laboriosam tempore voluptatum doloremque vitae ut id minus expedita iusto qui rerum debitis et repudiandae harum id maiores id quia neque ipsum velit doloribus ut maiores ullam velit expedita repellendus facere eos qui voluptates dolores ipsum ut culpa alias voluptatem debitis et quae dolorem quia optio mollitia in animi aut est ullam voluptatem ut cum et maiores ipsum et voluptatem sed asperiores nemo sapiente adipisci earum dolorem ut eaque dolor est deleniti et ea ullam architecto et quae rerum expedita eum rerum et perferendis placeat necessitatibus ad non voluptas amet inventore eligendi quod exercitationem beatae officia repudiandae provident natus quo molestiae et iste consequatur numquam magnam consequatur perspiciatis est facilis hic aliquam sint repellendus harum unde voluptatem corporis molestiae minima qui odio vero ea qui perspiciatis rerum deleniti ut dolores totam ut nobis reiciendis distinctio sapiente quos consequatur in illu