INSERT INTO `course_news` VALUES ('631', '6', 'Incidunt sint ipsum praesentium qui illum vero.', 'Cum possimus accusamus laudantium necessitatibus occaecati consequatur labore aliquid ipsam enim consequatur aut voluptates quidem incidunt quia sequi veritatis laboriosam fugit vero exercitationem sint esse enim voluptatem consequuntur harum aut omnis rem odio dolorum voluptate repellat at qui quia eligendi dolor cum rerum eum autem cupiditate quo rerum numquam voluptatem at quia voluptates quas vitae deleniti quaerat fugiat minus et quos omnis dolor sunt debitis corporis ut et et qui aut ipsam sed omnis eveniet officiis quod libero et hic corrupti enim et qui eum delectus in perspiciatis labore perferendis fugit unde sunt quia laudantium et pariatur labore laudantium velit eos sunt ut ipsum rerum dolores qui ducimus quidem et labore soluta quo itaque incidunt aut non aut provident repellendus aliquam itaque ipsam vero qui a doloribus autem mollitia laborum autem et sint cupiditate eum ad minus iure sit aut libero incidunt corrupti minima blanditiis repellendus et a et eveniet eaque et sit eius odit veniam ut cumque repellat suscipit perspiciatis quas illo quia consectetur hic vitae alias architecto vel quae aperiam quibusdam accusamus fugiat sunt cum possimus et et distinctio dolores eaque alias enim omnis nesciunt sunt vel deleniti fugiat ipsum id consequatur ipsam mollitia quae aspernatur odit hic expedita consectetur consectetur rerum earum est accusamus ex non qui necessitatibus et et molestiae odit et facere dolore earum enim exercitationem non omnis eius repellat eaque beatae vel mollitia reiciendis rerum repellendus quis eum esse voluptatem occaecati sunt facilis commodi beatae autem ea tempore et dolor earum voluptas eum nisi qui exercitationem sit ipsa voluptatem ipsa recusandae ut alias nobis quae sit minima expedita eius rerum nemo cupiditate qui a nihil officiis qui nisi voluptatum perferendis ex qui veniam asperiores iusto maxime voluptatum voluptatibus r