INSERT INTO `course_news` VALUES ('632', '9', 'Et aliquam culpa quos nihil repudiandae.', 'Soluta eum libero sunt velit veniam aliquam quae voluptatum ut corrupti cupiditate corporis necessitatibus sapiente ratione nam nobis vel vel molestiae est et praesentium incidunt sint sint molestiae tempore in ad cumque aliquid itaque ut voluptatibus saepe cum nobis explicabo earum labore magni cupiditate sunt officia vitae suscipit et velit incidunt repellendus asperiores sed earum ex consequuntur sint quam voluptatem qui quia laudantium vero est repellat placeat quia minus repudiandae quis et non sint non vero ex ut in id vel optio dolor optio eos aperiam quasi laborum sit enim culpa aut voluptatem quis soluta nam explicabo blanditiis quia distinctio fuga inventore nostrum esse omnis molestias qui voluptatem sint vel incidunt sed repellendus alias et minima mollitia nemo enim vero doloribus rerum asperiores deleniti expedita ut quis voluptas dolores et similique veniam eveniet quibusdam ex sed quibusdam sunt illo optio dignissimos voluptatum voluptatem exercitationem atque enim tempora et voluptas praesentium velit amet ut ut cupiditate asperiores tempora autem nam minus voluptas quisquam voluptatem maiores similique fugit velit ipsa ex voluptatem voluptatum accusantium asperiores necessitatibus earum dolorem blanditiis cumque voluptate corrupti maxime et consectetur aut dicta quia occaecati excepturi ullam et illum nostrum quia non aut id expedita ex quis et debitis saepe expedita ea minus sed molestiae ut corrupti rerum praesentium ab qui quia corporis sapiente doloremque reprehenderit saepe ut distinctio et quia iure reprehenderit quod iure saepe dolore in distinctio esse culpa aspernatur voluptas et vitae ipsum odio impedit eos facilis eum eveniet non blanditiis velit velit ut ut harum sed atque modi est rerum aliquam et iusto et sint voluptate quis tenetur laudantium harum maiores quia eveniet maiores repellat alias dicta harum dolorum eum aliquid cum unde voluptatem a