INSERT INTO `course_news` VALUES ('633', '5', 'Et nihil accusamus non et consectetur quibusdam eius quisquam.', 'Ut voluptates voluptas quos eaque ut ut et voluptatibus sint eum alias quia natus voluptates velit incidunt fuga distinctio placeat ut neque beatae quibusdam beatae quis cumque id maxime deserunt ut itaque quo optio ea velit modi velit repellat ut id dicta et quis ut ipsum excepturi eligendi est necessitatibus quasi enim adipisci esse quos necessitatibus voluptatem voluptate ipsa quam tenetur temporibus ea fugiat placeat magni similique eveniet accusantium mollitia et saepe aut ratione qui fugit omnis sunt quam voluptatem veritatis dolores aut et libero maxime assumenda fugit perspiciatis saepe est rerum voluptatem ut quod in nihil earum quis laboriosam recusandae adipisci dolor nobis aut necessitatibus voluptas laudantium et enim sapiente facere voluptas fugit iure corrupti ut porro facilis earum fuga enim nobis sequi mollitia dolorum vitae earum ut molestias ab eos nulla accusantium tempore officiis ab sunt similique eum modi animi possimus porro in error rerum quam dicta modi et voluptatem aperiam dolorem culpa corrupti perspiciatis iste exercitationem consequatur totam nostrum voluptatem tempore id nesciunt vitae aut quisquam adipisci ut beatae temporibus recusandae natus nostrum deleniti iusto blanditiis quod qui eius id deleniti delectus maiores commodi repudiandae blanditiis sed accusantium sit at molestiae nostrum enim explicabo nihil mollitia itaque dolores optio consequatur cupiditate et qui placeat saepe illo odio odio ad enim facere saepe eveniet incidunt velit saepe earum eos fugit nemo natus facilis fuga soluta eos illo possimus laborum enim sequi et ipsam voluptas autem esse vero quam rerum harum laudantium quia deserunt ex corporis voluptates rerum voluptates rerum delectus aliquid quisquam eveniet cupiditate perspiciatis voluptatum voluptas aut natus nesciunt consectetur sint nam molestias neque reprehenderit delectus inventore reiciendis