INSERT INTO `course_news` VALUES ('634', '1', 'Eum aut facilis ad.', 'Sunt exercitationem quia similique a et eligendi non cumque tempora saepe laboriosam nihil corporis deserunt illum doloremque ut ratione eius quos vel adipisci omnis iure in perferendis perspiciatis vel qui qui vero quos dignissimos vel minus corporis hic dolores nostrum aut dolore a numquam maiores nobis quo qui asperiores sunt iure nulla commodi eum aut quia eveniet quia totam tenetur veritatis provident voluptatem repellat qui ducimus molestias temporibus nobis ullam voluptas quia tempore qui consectetur aut voluptatem facere at adipisci ut vel laboriosam iure recusandae magnam quo velit suscipit velit magnam nihil commodi id est sed autem a quia odio est repudiandae et nesciunt quos aliquid aspernatur quidem aperiam quaerat earum eveniet corrupti magni et earum repudiandae sunt dolor fugiat enim nihil eveniet vel iure corrupti quo autem reprehenderit perspiciatis aut animi eum est natus autem neque vel corporis velit nihil eum provident distinctio sint enim aliquid velit sapiente quae voluptates minus exercitationem sunt asperiores maxime sed totam aliquam deserunt qui tenetur quia consequatur veritatis voluptatem perspiciatis qui adipisci sapiente consequatur rerum sit at laborum praesentium animi exercitationem sed voluptatum mollitia illo quis non nesciunt aut natus molestiae tempore modi nam quis repellendus sit dolorum aut aliquam consectetur tenetur cumque et perspiciatis minima laboriosam debitis corporis adipisci voluptatibus laudantium vero et necessitatibus eos alias dolores saepe voluptate rerum adipisci pariatur incidunt velit perferendis voluptas itaque vitae suscipit neque nihil omnis et eum hic numquam et repellat officia sint deleniti accusantium animi sit sequi quas distinctio illum odit saepe et soluta aut quisquam quia sunt vel saepe voluptas et quia dolorum quo nihil aliquid ut nobis assumenda consequatur non aperiam commodi vitae ut tempore ut et voluptatem itaque qui quos