INSERT INTO `course_news` VALUES ('635', '7', 'A et debitis velit omnis.', 'Unde sed expedita voluptatem minus earum hic dignissimos voluptatem quod voluptas earum autem qui qui optio ipsam ducimus qui culpa aut vitae voluptatibus saepe id a consequuntur eum deserunt non a aspernatur laboriosam aut sed numquam voluptatum facere cupiditate voluptatem magni porro ducimus ut enim adipisci sequi aut est non in ut sed aut quos quia error pariatur dignissimos molestiae alias sunt similique quo et esse explicabo quisquam odit doloribus similique rerum labore doloribus et quod molestiae enim quos quasi molestiae facilis dolor dolorem earum natus sequi doloremque et vitae et tenetur autem id vel fugiat qui optio quisquam enim saepe tempora vitae qui incidunt ipsa sit quibusdam quaerat omnis sequi modi molestiae ut libero repellendus aut natus iusto illo et sunt ipsum molestiae corrupti repellat at rem voluptatem voluptatem autem ad fugit sequi quidem libero recusandae error et laborum sequi omnis assumenda atque temporibus ad facere iure maiores aut autem expedita et ea et atque velit eos ut error labore earum aliquid porro cupiditate eligendi repudiandae pariatur dicta aut vitae dolore occaecati omnis voluptatem dolorem ipsa asperiores ut rerum voluptates consectetur et placeat dolor hic doloribus id maxime et non sint nostrum velit aut molestiae facere tenetur doloribus velit officiis velit corrupti consectetur autem eius rerum sunt error dolores qui sit possimus vel doloremque non maiores placeat reiciendis dolores quo dolores magnam omnis itaque doloribus sed aut dignissimos omnis voluptatum placeat officia aspernatur sed fugiat rerum voluptatum qui corrupti et sit iure dolores ut odio dolorem perspiciatis aut perferendis qui rerum non recusandae repellat quibusdam non nostrum et qui vero officiis omnis suscipit beatae culpa placeat voluptas distinctio porro totam dolores quos et veritatis unde odio quibusdam nihil quis aut est reiciendis quo voluptas maiores ex alias in