INSERT INTO `course_news` VALUES ('636', '2', 'Quis id culpa qui voluptas.', 'Ducimus minus qui qui commodi quia ea ratione corrupti praesentium sit a voluptatibus soluta maxime illo architecto cum consequatur cum quia totam explicabo facere eius perferendis laborum ea voluptatem alias dolorem temporibus eaque quia commodi sit labore id quia occaecati soluta rerum aut quis officia omnis et id totam occaecati natus laboriosam nemo ullam earum eaque adipisci iusto aspernatur voluptates consectetur corrupti assumenda provident dolores exercitationem rerum magni explicabo earum eum itaque eos et repellat quod dolores nisi eius quia quo dolores minima nisi corrupti reiciendis et eaque corporis itaque illum minima dicta eius eos voluptas voluptas mollitia et debitis minima similique rerum tempore dolores sint nihil blanditiis ut possimus iste explicabo vero laudantium quidem enim optio sint qui voluptatem placeat dolor repudiandae sunt beatae aut voluptatem minus et odio qui sed similique sunt quis rerum unde odit sed accusantium odit nisi voluptatem deserunt ipsa quibusdam aut et eos accusantium rem quia dolorem non quis totam ut quo harum ut ratione voluptate iure eveniet quidem sit enim non sint enim facere sed optio occaecati in blanditiis libero ad in eligendi sint aliquam fugiat dolores qui qui ut dolores et repudiandae ut fuga minus ab tempore ad et eum quaerat deleniti qui molestiae modi sit ipsum est rerum illo non dicta quia atque voluptatem modi ab vel ullam nam esse est placeat nobis nesciunt quibusdam ex et sit fugiat optio natus ut porro voluptas neque dolorem excepturi ea sed perferendis praesentium consequatur enim quos repudiandae sunt voluptatum consequatur sit id iste earum vitae dolorum fugit deleniti et in eos ut quasi quo est veritatis quia sed in cupiditate assumenda iusto eius eaque quaerat aliquid molestias doloribus non rerum molestias odio error sapiente quae et autem in velit aspernatur assumenda qui velit velit et fugiat consequatur rerum repe