INSERT INTO `course_news` VALUES ('637', '2', 'Minima nisi repellendus mollitia voluptates et in.', 'Ipsa sint ut ut fugit occaecati sint numquam totam eaque blanditiis nisi voluptas sint corrupti eligendi consequatur quas dolor ipsa omnis tenetur libero at sequi ut dolore voluptatibus expedita voluptatum aspernatur veniam voluptas necessitatibus laudantium assumenda aperiam temporibus ab ipsam quis iure assumenda sunt asperiores voluptatem sint est doloribus voluptas quaerat saepe doloribus et et soluta incidunt iusto maiores voluptatem consequatur libero qui voluptatem autem nostrum maxime tempora at dolores et officiis placeat suscipit ullam et necessitatibus facilis optio aperiam repellendus aut necessitatibus deserunt dolor dolor provident explicabo iure qui dolores commodi iusto magni impedit doloribus commodi tempore aliquid consequatur consequatur culpa ipsum sed voluptates rerum commodi culpa facilis optio labore beatae molestiae vel iste maxime ullam facilis voluptas alias ea quam pariatur non magnam excepturi enim itaque dicta magni alias facere numquam esse alias animi suscipit sit asperiores dolorem recusandae debitis non accusantium voluptas fugit molestiae nobis laboriosam molestias velit et doloribus impedit placeat at quo fugit repellat officiis aspernatur itaque ea quo quia recusandae temporibus et eligendi enim vitae dolore temporibus quia aliquid eos laboriosam et velit dolorem rem dolore accusantium possimus mollitia non dolores iste voluptatem et velit accusantium non quo nostrum voluptatem et ut qui assumenda aut labore rerum quam debitis maiores nesciunt autem omnis illum sapiente accusamus qui et voluptatibus ullam ullam nulla possimus placeat perferendis consectetur possimus sed accusantium nam amet provident a dolorem dolor neque.', '1', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('638', '3', 'Ratione eius est et quos sit porro.', 'Assumenda nisi est voluptatem deserunt quisquam et et asperiores enim minima et aut non sint rerum cum velit soluta id aut perferendis aliquam ullam perferendis quam quidem nesciunt molestias autem doloribus qui facere sed quia officiis quia ut odio veritatis voluptatum autem dolor quo animi dolores cupiditate illo sed nam sit voluptatem nostrum rerum cum cum autem harum explicabo ea deleniti quisquam quae non animi nulla consequatur quo sit libero non sapiente nesciunt eos harum nemo impedit quis fugiat dolorem optio est nulla ad quo non dolores et et deleniti delectus sit perferendis et quis perferendis autem asperiores corporis vero omnis nobis accusamus quae laudantium voluptas vitae adipisci sed eum esse est vitae iste voluptatem consequatur ullam molestiae est est laborum ut suscipit praesentium reprehenderit temporibus facere vel id necessitatibus rerum nemo voluptas nostrum minus molestias ut voluptatem tenetur non non similique vero error eligendi distinctio quae alias qui perferendis nihil facere ipsa nostrum asperiores debitis odio sit aliquid debitis debitis omnis commodi dolor reprehenderit aut et illum qui sapiente voluptates et alias iste magnam at molestiae ea occaecati quia illo qui soluta eius suscipit qui nihil culpa dignissimos non aut aspernatur omnis voluptate eos maiores ullam quis alias consequuntur delectus ut aut harum saepe beatae inventore commodi autem voluptatem occaecati incidunt sed eveniet consequatur dolorem omnis eaque rerum cumque voluptatem eveniet et nostrum ipsum soluta et enim praesentium alias ut optio architecto magnam ut aut est ut quas iure non asperiores ut aspernatur soluta soluta necessitatibus aspernatur modi quos quisquam molestiae cupiditate corporis assumenda aut sed beatae rerum quia est ut accusamus expedita consequatur qui recusandae autem quas nam quis ut ea fuga rerum consectetur exercitationem maxime ad doloribus magni culpa 