INSERT INTO `course_news` VALUES ('639', '9', 'Quia labore impedit doloribus qui corrupti aut.', 'Architecto cupiditate eos deleniti qui perspiciatis voluptatum corporis voluptate sint rem quo architecto eos et eum nam quo tempora quia maxime tempora alias quia consequatur et excepturi cupiditate sed temporibus facilis a rerum velit nam unde vel sit eligendi autem soluta incidunt dicta corporis at dignissimos iusto veritatis dicta quod cupiditate omnis voluptatem ut perferendis sequi autem molestiae animi cupiditate animi sit id repellat quia id reiciendis quas facilis assumenda ipsa aut odit cupiditate esse possimus autem ab et necessitatibus iste qui cumque magni et aut ex et et consequuntur id ipsum aut vitae quidem aut blanditiis dolorem dolorum reiciendis omnis esse fugiat provident facere ut inventore animi illum labore nam ipsa eos non qui cum sit voluptatem aut et aut rerum sunt amet facere dolorem sequi aut quo fugit maiores autem nesciunt aspernatur magnam distinctio iusto dolorem dolor aspernatur sint qui culpa velit et eius sint repellendus explicabo labore voluptatem voluptatum quia tempora voluptatibus cupiditate ullam quis odio incidunt ipsa qui nemo explicabo non labore eos vero rerum inventore voluptatem officia veniam omnis nobis exercitationem temporibus necessitatibus sit inventore voluptatibus eos rerum beatae rerum quis autem delectus dolorum facere libero fugit et non accusamus aut unde occaecati dolores facere consectetur doloremque quia tempore porro nostrum sapiente est consequatur maxime non minus accusantium et non soluta corrupti ullam qui fugit labore ratione sed eaque et placeat eligendi voluptatem repellendus nostrum aperiam et nisi dolorem eum autem et impedit qui reprehenderit eveniet nihil ex et suscipit omnis eum provident modi consequatur et eveniet eum est sed accusamus quo dolor quia accusantium voluptatum repellat facilis exercitationem enim esse suscipit ut tempora debitis quia rerum consequatur aliquam omnis molestiae quasi aliquam voluptatem iusto aperiam et consequuntur soluta rerum ut quo labore nulla aut omnis qui quas ut voluptatem recusandae nesciunt in itaque dolor neque esse ut temporibus deserunt consectetur enim voluptas excepturi iusto veritatis autem officiis omnis et nemo aut sed atque labore et magnam incidunt qui in quis doloremque consequuntur quae vitae impedit molestiae eaque sit iusto quia rerum velit rerum laboriosam totam nesciunt quod magnam aspernatur a ut libero quo qui est quia cum rerum tenetur dolores et eos nam enim quis esse accusantium necessitatibus voluptatem et animi qui nostrum voluptatem odio illo voluptatem autem harum esse adipisci aut qui aut deleniti aspernatur voluptas enim unde occaecati ut aut sit fugit ea dolor omnis debitis dolore id non non iste quae.', '1', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('640', '3', 'Sequi eveniet incidunt ut cupiditate voluptatem.', 'Ex culpa eos quasi minus a ratione consequatur aut minima quas et pariatur ea neque consequuntur et recusandae itaque aut qui facilis sunt recusandae voluptas qui error maxime quia ut soluta vitae esse neque numquam id facere itaque ea veritatis reprehenderit impedit illum inventore necessitatibus architecto aut non est quod voluptas nobis qui voluptas ullam cupiditate quia eveniet aliquam dolorem repudiandae et sint dicta iste et ea ea et eum cupiditate illum aut animi fugiat ipsam est aliquam necessitatibus ipsam adipisci sed necessitatibus qui eum qui enim dolores et asperiores non autem incidunt eius aut iste iure veniam molestiae dolore delectus ut eius vero neque voluptatibus eveniet qui magnam et quis ratione vel ab quod cum numquam sed non sed earum minima ducimus error quod necessitatibus nisi excepturi labore dignissimos consequatur illo voluptatem mollitia rem est repellendus quibusdam earum accusantium consequatur ipsa dolorem praesentium molestiae et est itaque illo totam veniam enim reprehenderit molestiae qui nobis temporibus ut odit dolorem ipsum in consequatur cumque labore vitae at tenetur enim ipsum aliquam sunt dolorem repellendus ut sequi consequatur odio atque perspiciatis dolor explicabo exercitationem porro modi qui molestiae illum quas sit recusandae sapiente exercitationem asperiores impedit non et reprehenderit et et fuga et autem ea quia iusto assumenda in vel deserunt voluptas rem possimus voluptas perspiciatis ut et id perspiciatis aliquam voluptatem iste modi possimus quae debitis soluta eligendi facere ipsam ipsam non commodi esse illo voluptate ad exercitationem fuga pariatur reiciendis voluptatum ad eveniet est eaque praesentium non nesciunt ratione asperiores est totam voluptatem aut necessitatibus at voluptatum architecto sunt nisi neque ipsam quidem doloribus ad non deleniti ratione omnis iste perspiciatis a voluptatem ducimus imped