INSERT INTO `course_news` VALUES ('641', '10', 'Nam accusantium porro quibusdam magnam.', 'Qui officiis consequatur neque dignissimos rem minus id reprehenderit ipsum voluptatibus ut hic deserunt eligendi nisi aut et voluptas enim doloremque nostrum enim nemo qui labore explicabo blanditiis totam quos soluta illo dolore voluptas distinctio cupiditate corrupti doloremque voluptas sed omnis exercitationem incidunt necessitatibus aut natus harum incidunt aut aliquid totam tempora ipsum est explicabo provident corrupti quisquam voluptas sunt et aliquid libero corrupti temporibus officia harum quia est laborum officia aut adipisci sunt provident incidunt cumque dolores ratione et aperiam illum nihil animi reprehenderit vitae enim sequi iure debitis dicta dolore et qui quia quibusdam et distinctio porro amet doloribus consequatur similique consectetur omnis laboriosam autem sed enim ut corporis officia aperiam ut ipsam ad dolores perferendis temporibus culpa non et magni ab temporibus inventore quam autem voluptatem voluptates cupiditate ad odio minus at vitae a omnis natus aut eveniet dolorem consequatur id consequatur id asperiores et in aspernatur quae libero expedita nemo repudiandae velit rem et nihil blanditiis voluptatem eum labore et cumque ea eveniet culpa facilis quaerat deleniti omnis quis nesciunt ratione in praesentium cupiditate incidunt asperiores sunt omnis inventore consequatur consectetur voluptas quidem qui et deserunt illo quo blanditiis odio laborum expedita inventore et et cum sed molestiae delectus animi sint placeat nemo mollitia illo mollitia iusto at qui voluptatem ut rerum similique quis neque est aut praesentium qui alias est temporibus optio omnis perferendis error iure neque officiis et eius provident delectus qui porro praesentium illum facilis molestiae necessitatibus sit omnis possimus dolorum ex error perferendis labore nemo quam ut ut nam earum pariatur enim fuga qui voluptatibus ad neque blanditiis ea asperiores eaque consectetur et qua