INSERT INTO `course_news` VALUES ('642', '6', 'Inventore quia itaque est eum voluptatem dolore consectetur.', 'Sint est nesciunt cum ut similique animi quae minus libero laboriosam quidem harum libero perferendis omnis magnam modi quia ratione sunt corrupti omnis fuga dolor consectetur quasi tenetur aliquam ut incidunt voluptate modi aut et adipisci tempora quam recusandae tempore quam nemo quia illo culpa excepturi quasi quis amet perferendis rerum molestiae expedita eos ea a ratione et facere explicabo totam laboriosam commodi molestiae ut minima explicabo repellat assumenda quisquam facere nihil et eligendi et cum est mollitia perspiciatis aliquid quia architecto necessitatibus dolore exercitationem nobis odio quasi velit ut dignissimos natus aut temporibus consequatur soluta laboriosam molestiae libero doloremque consequatur numquam et omnis expedita recusandae veniam ut saepe in similique quam magni dolor facilis corrupti maiores et quidem veritatis praesentium odio sunt fugiat laborum eaque perspiciatis et quo tenetur atque eos dolorem sed nobis quam soluta est reiciendis vitae et ipsa corporis ea aut id corporis sint ut sint velit velit mollitia eos odit quisquam a ut amet sunt ipsum fugit dolorem autem quae delectus eos alias aliquam ut sit id ad natus nihil molestiae esse hic perspiciatis maiores veniam soluta rerum quo eaque ipsum nihil id inventore deserunt excepturi temporibus accusamus dolor tenetur iste odit aut aut quia ipsa asperiores quia adipisci nulla in totam repellat dignissimos perferendis ullam dolor praesentium nam possimus quis repellat velit velit sunt architecto molestiae dolores quasi beatae quis possimus consequatur et aut placeat voluptatum enim quo unde nisi possimus sed deleniti porro sed harum culpa incidunt dignissimos delectus aut voluptatem odio consequatur optio distinctio et sed corrupti quam vel explicabo odit quisquam voluptatibus officiis repudiandae qui fuga natus recusandae non ea exercitationem quo quos est nesciunt dolori