INSERT INTO `course_news` VALUES ('643', '9', 'In iure aut asperiores doloremque ipsa impedit et alias.', 'Ut veniam molestiae minima corporis aliquid quis rerum esse voluptas quo et cumque corporis exercitationem distinctio distinctio quos ullam quis aliquam quos aliquid ut ab expedita rerum labore ducimus perspiciatis fugiat amet facere necessitatibus id impedit omnis quia ipsa dicta soluta corporis perspiciatis minima corporis dolorem doloremque magnam atque provident vel iusto perferendis tempora culpa quasi repellendus rerum quas repudiandae ut sed et explicabo omnis repellat qui et velit minima voluptas voluptatibus consequatur tenetur numquam aperiam fuga aut eius eum et occaecati temporibus aut voluptates voluptatem quia et quae reprehenderit odio voluptas quod ut sed quam ex est soluta voluptatem ut dolorem sapiente deleniti deleniti qui et reprehenderit ut nulla consequatur libero recusandae cupiditate tempore totam ducimus nobis omnis aut molestiae eos minus odio a praesentium voluptatem praesentium sequi repellendus corporis neque consectetur reprehenderit quidem et eligendi et ut nihil quidem itaque et consectetur et est doloribus officia dolore eveniet est ea nihil perferendis quis libero numquam non quam possimus odit nostrum dolorem et vitae eius voluptas consequatur quia dolorem adipisci amet ab quo provident laudantium laudantium impedit facere aut eos non aperiam reprehenderit deleniti est est delectus debitis aliquam nihil minima ipsum eligendi sit illum vel pariatur sed incidunt fuga non cupiditate quo ut nemo eius sed est optio nam beatae enim molestias consequatur autem iste cum aut mollitia quod consectetur ducimus cum aut sint voluptatem aut vitae laboriosam sed inventore sunt sint amet tempore rerum quos reprehenderit officia ullam voluptatem asperiores pariatur error ducimus vel assumenda animi dignissimos enim doloremque ea reprehenderit fugit nostrum molestiae est qui et deserunt quibusdam sed est impedit laborum enim ut et iste quia cum