INSERT INTO `course_news` VALUES ('644', '4', 'Eligendi est earum explicabo alias sunt.', 'Est eos deleniti minima saepe nam cumque amet at nam saepe ut qui sapiente consequatur cupiditate modi minus labore commodi adipisci nobis et laudantium impedit nam impedit et quas aut sequi occaecati dolores ut ullam quis consequatur deserunt illo enim nihil porro ea qui quibusdam sed voluptas assumenda tempore iste in ipsum officia autem repudiandae et consectetur ex voluptatem asperiores quae necessitatibus corporis tempora omnis illum repellendus consequatur tempora facere quas dolor aspernatur qui enim rerum commodi itaque iure magnam unde autem ea voluptatem expedita quibusdam animi at omnis temporibus non maxime veritatis commodi dolor non in assumenda voluptatum voluptatibus voluptatem velit voluptates non laudantium molestiae velit incidunt aliquam aliquam ut et et qui molestiae doloremque perferendis aspernatur iusto facilis ratione necessitatibus magni voluptatem voluptate quo unde dolore doloremque enim illum recusandae eum at voluptas enim unde aliquid in deserunt eaque vero doloremque quia soluta explicabo et aut illum at quo repellendus qui rerum dolore aliquid consectetur voluptatem dolorum explicabo sint eaque in et quidem aliquam consectetur et veritatis id voluptatibus nisi rerum ex dolore et saepe libero commodi id dolor.', '0', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('645', '9', 'Sed quaerat quia aut.', 'Expedita quaerat voluptatum est officia omnis quaerat adipisci fuga deserunt rerum reprehenderit voluptas illum sed animi deserunt voluptatem dolore qui quas expedita voluptas in est sed aspernatur qui et ea cum iusto sint magnam eius asperiores enim quasi blanditiis atque et odio illo dignissimos eveniet non quis ipsa odio explicabo necessitatibus asperiores eligendi quia autem voluptatem autem adipisci dolor et illum eos animi deleniti laudantium error fugit ea natus hic impedit quaerat maxime culpa vel consequatur eius sed reiciendis minus quis quidem soluta delectus omnis aut quo in nesciunt ratione quibusdam qui ut aut necessitatibus consequuntur animi nostrum totam quia dignissimos distinctio eum dolorem distinctio quaerat neque in repellat dolores inventore sunt error sit quis recusandae voluptatem rerum nulla et dolorem minima nostrum ut consequatur vel est expedita itaque libero hic ea sed praesentium iusto ipsam a ipsam fugit neque repellendus sit autem mollitia culpa sit voluptatem mollitia rem omnis velit nihil et rerum consequuntur qui ipsa autem quasi quod placeat nisi aspernatur mollitia quidem eveniet labore cum esse dolores eum quis delectus natus est aperiam et soluta iure commodi dolor praesentium et qui et ut dolor assumenda eligendi veniam amet numquam consequatur tempore nobis eaque deserunt eveniet sed beatae et id quam molestias et sapiente recusandae adipisci facilis in consequatur commodi soluta quas aut quis fugiat laboriosam consectetur libero dicta repellat unde qui quis deserunt quia voluptas asperiores dolores ratione quo rerum reprehenderit qui vero et iste dolor et quis aliquam sit natus minima eligendi aut dicta officia quia ullam eligendi natus eos iure eum id ut amet non expedita fuga a et blanditiis voluptatum qui sapiente est quod possimus sint voluptatibus quo molestiae quasi eligendi voluptate quia dolore iste aut accusantium iusto nulla cumque fugiat volu