INSERT INTO `course_news` VALUES ('646', '3', 'Aut dolore voluptates cumque consequuntur dolore ea qui.', 'Sequi velit nesciunt doloribus facilis sapiente quidem illum nesciunt nostrum animi et eaque sit sed aperiam aliquid nihil quis qui autem repellat voluptas maiores aut natus error consequuntur tempora eius quisquam veritatis accusantium non in similique soluta voluptatem aperiam suscipit laudantium placeat iusto voluptates et sint qui sequi temporibus optio vero cumque sunt reiciendis rerum rerum eos dolorem eos aspernatur beatae dolorum quos sed provident aut quos voluptas ea autem doloremque rerum accusamus suscipit excepturi rerum sit tempore quibusdam totam et voluptas porro enim unde ea ducimus architecto doloremque consequuntur quidem laboriosam eligendi labore aut incidunt voluptatem qui illum aut qui nisi quam commodi ea qui harum fugiat et dolorem commodi deserunt nam delectus dignissimos qui vitae aut nihil ea et doloribus nam officia excepturi consequatur cumque facere nesciunt dolorem et voluptatem id dolores a sed rem id molestiae repellendus ipsum eligendi repudiandae et minima ab necessitatibus eius ut quam qui ipsum laborum inventore molestiae ducimus porro modi sit non sit cum natus ut et necessitatibus molestiae autem expedita ut aut quia error voluptatem est fugiat et ut ad ducimus eveniet laborum ut optio porro sint ut voluptatem fugit totam nostrum unde et eius fugiat eligendi in iusto odio suscipit aut aliquid quia quasi modi est odio modi sed mollitia dicta facilis omnis quo qui facilis voluptatem dicta dolores architecto tempora aperiam delectus voluptates dignissimos sit provident ad est ipsa quasi quisquam dicta ut velit tenetur consequuntur explicabo et est in non qui fugiat culpa ad consequuntur vel natus voluptas praesentium dolor hic error numquam dolor aut reprehenderit porro exercitationem consectetur aspernatur autem voluptas similique suscipit molestias exercitationem enim nam rem ipsam qui qui quis eos voluptatem nostrum placeat inventore nobis reprehenderit debitis dolorum facilis eaque at incidunt et consequatur cumque iusto laborum suscipit repellat expedita eos esse voluptatibus repellendus eos corporis consequatur labore exercitationem perspiciatis voluptatem atque sit ex non doloribus necessitatibus aspernatur nisi culpa error dolorum officia itaque est sit doloribus et sed voluptas fugit aut enim velit minus.', '1', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('647', '8', 'Doloremque maiores voluptatem beatae nisi.', 'Nam eos assumenda facilis consequuntur neque eum beatae et eveniet quidem possimus officiis aspernatur harum possimus iste eaque sequi in omnis eos dicta accusamus architecto qui et beatae aperiam qui fugiat odio quisquam autem impedit ad ea nemo necessitatibus assumenda fugiat dolor quia unde quasi quaerat ut totam ut et minus nihil sit mollitia temporibus nihil repellat fugit aut iure sapiente excepturi expedita ut deserunt dolore fugiat minima enim dolorem atque maxime velit similique rem esse illo mollitia facere consequatur eos qui et deserunt reprehenderit qui deserunt voluptatem assumenda incidunt odit et enim in distinctio non ipsa dolores perspiciatis eum nemo vel vel qui qui quasi possimus omnis aliquid sapiente quia molestias aut facilis deserunt nulla sit aut facilis est magnam adipisci alias quas inventore distinctio voluptate quia velit ratione amet dolor sit sed est eligendi odio sint ipsum qui architecto sunt nesciunt consequatur hic laborum exercitationem laudantium voluptatem repudiandae ut dolores incidunt qui harum impedit nulla tempora fugit ea et quia autem sint doloribus nobis quam voluptatem saepe aut labore ipsum nobis nesciunt excepturi corporis impedit enim et quia enim et nesciunt totam error veniam et repudiandae molestiae nobis vero sint molestiae et dolores quam voluptatibus repellat quidem fuga incidunt quis et sed ut rerum nobis dignissimos nostrum ad quia laudantium nemo est eos error quod at non voluptatum eum quia sed et voluptates debitis et qui similique praesentium unde rem atque voluptas non porro modi veritatis facilis voluptas dicta culpa iure rerum voluptatibus tempore ut maxime et provident deserunt nulla ducimus et accusamus laudantium consequatur et unde laudantium quod sit officia qui aliquid non dolorum fuga illum cum aut in voluptas suscipit hic ratione hic expedita suscipit est in minus quis et alias iste maiores soluta id sint nihil occaecati sunt autem maxime sunt totam aut cupiditate mollitia unde ea occaecati accusantium culpa suscipit et non eligendi autem perspiciatis consequatur officiis eaque ut doloremque voluptas distinctio voluptas nostrum ut ratione et sed assumenda dicta deleniti consequuntur libero voluptas et expedita quas qui iusto harum ipsam exercitationem saepe blanditiis et officiis in ratione assumenda culpa earum ipsam qui quod velit culpa est esse quasi nemo laborum officiis ut tempore ea eveniet inventore et odit voluptas id aut deserunt ea non tenetur et quia esse sequi voluptas ratione et omnis minus molestiae ducimus et et nam laboriosam rem corrupti mollitia ea itaque est non ipsum animi natus quis et voluptate officia sapiente at et sunt repudiandae excepturi molestiae at eius id repellat mollitia provident praesentium aut cum fugiat.', '0', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('648', '6', 'Ut doloremque ut laudantium nulla.', 'Quas modi illum blanditiis maiores ex adipisci eveniet iste vel labore laborum autem deserunt modi accusantium exercitationem qui tempora cum eum et necessitatibus impedit velit dolore tempora tempora nisi aut aliquam voluptas aut incidunt nesciunt officiis enim cupiditate facilis aut pariatur aut quae id dolor ipsa et corporis alias eligendi consectetur ipsum laborum sint neque similique autem sit cum aut et quam exercitationem unde rerum odio sint ut porro porro nisi vel quia beatae aut et accusamus est provident quas totam sit occaecati autem facilis fuga et tempore asperiores iste quo amet ea optio nulla illum cupiditate voluptas est corrupti voluptatem quos dolor quidem corporis nesciunt cumque vero sunt id a quam suscipit nisi consequatur labore qui voluptatibus odit ea et fugiat eos rerum eos et a rem et blanditiis voluptas ea aut aspernatur nihil reiciendis voluptatem molestiae quisquam sit hic vel cupiditate in vitae occaecati et officia aliquam sunt quos eveniet nisi qui et qui sed id dolores ad non occaecati rerum et modi et officiis qui quia odio consequatur commodi corrupti qui saepe nihil sed eos cum ea ut harum nostrum facilis consequatur culpa autem amet magni mollitia quis quibusdam vel voluptatem aut magnam voluptas consequuntur consequatur.', '1', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('649', '2', 'Velit sunt nihil eum.', 'Impedit nulla voluptatibus dolor labore autem sequi ut dolorum voluptas voluptates recusandae cupiditate molestiae ducimus laborum minima labore expedita recusandae nemo et illum laudantium nesciunt odit in omnis quo saepe velit nemo repellat qui pariatur vel est fugit est fuga ut omnis et vero doloribus optio aliquam et officia minus et sint facilis sint nulla et assumenda pariatur soluta ab exercitationem suscipit similique quis illum pariatur quia quam rerum illum voluptatem fuga facilis sunt perferendis molestiae aut unde accusantium aut expedita alias cum deleniti aliquid pariatur excepturi sit qui explicabo recusandae provident ipsum qui vitae sed non tempora quos doloremque est in asperiores sed quia dicta dolores aliquam qui aut laudantium ullam suscipit quibusdam temporibus sed assumenda et aut aut cupiditate pariatur sapiente facilis adipisci sapiente culpa asperiores porro quis blanditiis hic rem accusantium recusandae repellat similique est atque alias praesentium similique doloremque possimus consequatur eligendi recusandae eos qui aut officiis non et et eligendi fugit pariatur velit in ea eaque eos dicta ipsum qui molestiae aspernatur voluptatum qui temporibus eveniet aliquam sit blanditiis ad voluptas omnis vel quidem nemo inventore similique soluta autem veniam totam provident vel beatae id id et totam in labore pariatur dolores distinctio voluptas sed quo qui quis est magnam quia rem qui quasi non quia molestiae necessitatibus neque est iste cumque voluptatibus aliquid quibusdam blanditiis officia nobis aut omnis nesciunt ut consectetur et molestiae veritatis est dolorem reprehenderit quo laborum quas doloremque omnis tenetur cupiditate amet cumque sit ut amet voluptas possimus quia voluptate necessitatibus quos amet nobis ipsam dolorum et numquam optio odit sunt accusamus sint soluta rerum repellat modi quia voluptatibus laudantium architecto at quaerat quae.', '1', '2017-05-02