INSERT INTO `course_news` VALUES ('650', '3', 'Sed quia quia quod eaque officia.', 'Natus aspernatur placeat occaecati nam harum doloremque vitae magni et dolorem ut illum rerum commodi adipisci voluptas ducimus aut rem magni distinctio quam officiis fugit quae ipsa ut perferendis eius vel rerum veritatis sint quis eos ut mollitia est aut cupiditate ullam autem esse enim debitis maiores suscipit ipsum quos sed vel rerum sequi illum eos maxime in illo veniam omnis dolorem eos error laboriosam corrupti aut quo ducimus provident architecto rerum temporibus et excepturi exercitationem dolores et natus minima non eos veniam sed vitae omnis quibusdam architecto quaerat quibusdam harum a veniam id rerum aliquam voluptates culpa voluptas illo eligendi aut quasi sequi pariatur illum modi corporis eveniet quia rerum perferendis aut repellendus ut non inventore distinctio aut quam reiciendis vitae nemo est explicabo iure a cumque sit iste amet a molestias veritatis in quaerat et quis est omnis voluptas nisi itaque quaerat fugiat rerum qui est minima natus consequatur voluptatibus nihil harum nostrum et eos reprehenderit perferendis voluptas quas cupiditate excepturi qui voluptatem nam quis laborum voluptatem in sed autem quo excepturi porro officia quidem a voluptatem nam ullam consectetur ad sapiente consequatur eligendi culpa voluptas cupiditate soluta omnis ut fugit impedit eligendi ducimus ut voluptas laboriosam eligendi numquam enim enim atque suscipit id reiciendis iste eius aperiam facilis qui amet non omnis consequuntur doloribus iusto voluptatem delectus deleniti et optio eum error voluptate asperiores quibusdam sequi voluptate qui itaque dolorem deleniti dolores quia voluptatem nobis rerum dolorum similique iusto officiis dolorem perferendis quia et placeat nulla aut repellendus qui aut placeat qui quod aut corporis veniam.', '1', '2017-05-02 22:59:22', '2017-05-02 22:59:22');
INSERT INTO `course_news` VALUES ('651', '4', 'Soluta similique quidem maiores ut.', 'Consectetur sed facilis sed voluptatem harum nulla id sunt sunt molestiae hic id qui ratione earum vel non quia ut quisquam ducimus atque repellendus consequuntur autem temporibus non qui nulla magni omnis et corrupti deleniti atque pariatur consequatur veniam dolores nostrum ab iusto magni esse inventore libero expedita a enim id omnis ut beatae sit doloribus aut molestiae ut ratione expedita et quos labore aut quae recusandae necessitatibus asperiores dolorum sit amet soluta unde corrupti ut dolores iste et consectetur tempore asperiores iure sint est amet sed corrupti amet incidunt veniam ut voluptates omnis suscipit cumque rem est et ad commodi et illo provident rem iure enim nulla quia quam corrupti necessitatibus omnis consequatur provident quo culpa fuga totam rem quia voluptas saepe pariatur rerum non aspernatur corrupti omnis natus ea maiores at eius unde eos animi non vel sit qui quibusdam quia recusandae autem magni ex qui voluptatibus sed cupiditate ut ipsam deleniti iure vero ut dolores similique minima saepe quas assumenda praesentium velit blanditiis aut expedita quas sint consequatur deserunt ut velit modi sint enim nulla tenetur rerum quos quae accusantium qui harum et dolorem aut quia illo sit cum distinctio enim reiciendis quisquam ab enim eveniet ratione qui voluptatum illo voluptatibus error commodi inventore aut autem atque adipisci accusamus eum ex accusantium nam dolorum assumenda et veritatis voluptas ut ipsum quam omnis soluta aut ut voluptatem modi tempora vel libero eos molestias quam voluptas consectetur eum odio ullam et at aspernatur accusamus ratione vel consequatur est ex aut quam laudantium qui ipsa nemo maxime voluptatem voluptates quia quibusdam voluptatibus delectus et neque laboriosam voluptatibus sequi qui inventore quos quisquam laboriosam nam minima sit aperiam reprehenderit laboriosam aut sunt consequuntur earum laudantium soluta labore lau