INSERT INTO `course_news` VALUES ('652', '3', 'Est a vero rem quasi.', 'Quia est doloremque voluptatum ullam officiis sint mollitia mollitia pariatur fuga odit temporibus repellat aut dolore laborum quae placeat porro est cupiditate dolorem debitis numquam ea rerum eum ad maiores eius et qui libero provident voluptatem veniam ea ratione aut sed tenetur beatae quia pariatur consequatur quos non dolores quia dolorem voluptatibus minima quibusdam exercitationem qui non saepe officiis totam fuga dolorum voluptatem sequi voluptatem et odit cupiditate dolorum ex sit aperiam quia error debitis voluptatem autem dolores explicabo odit non eius eveniet distinctio voluptatem nemo vitae quae asperiores ea distinctio amet quaerat vitae hic nam maxime consectetur et ipsam et nihil beatae reiciendis architecto voluptatem enim officiis at nihil magnam ut numquam doloribus sit id et occaecati beatae voluptas rerum dicta ullam dolores ipsam est officiis ut consequatur temporibus est velit et adipisci ut eos voluptatem tempora est dolores et in ut eligendi sed dolorem deserunt et quam placeat dolorem fuga a sit et vero velit consequuntur id est et et autem ab sit placeat fugit excepturi explicabo minus unde sint aut distinctio repellat sequi hic error sed nobis quia explicabo nisi incidunt et earum id fuga nulla soluta eligendi fuga nam esse dicta aut esse autem occaecati blanditiis dolorum labore ratione dolore velit quibusdam repellendus et dolorem in minus aut dolorem voluptatem fugit inventore ut minima aperiam dolores dolores consequatur eaque incidunt vel quam saepe dolorem qui nemo ullam ratione est accusantium non numquam atque aut ea sunt necessitatibus.', '0', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('653', '2', 'Rerum molestiae dolore consequatur suscipit ipsam omnis.', 'Sapiente quia et consectetur voluptatibus aut ipsam excepturi vel et praesentium laborum vel reiciendis possimus quam in dignissimos est eum veniam asperiores quidem vel est enim voluptatem ducimus dolor eveniet incidunt id nobis sunt vel amet voluptate unde ex sit et voluptatem quae perferendis et at libero minus et nobis vero fugit sint molestiae cumque libero in commodi ut molestiae perspiciatis eum facilis sint cumque aut debitis voluptatem dolores adipisci architecto omnis sed voluptas ad consequatur sint vel sapiente dolores harum nobis autem nisi officia aliquid cumque eaque doloribus incidunt eaque qui ut eos est perspiciatis rerum rem sunt officiis rerum aliquam voluptatem rerum quia quod architecto neque possimus nobis placeat quia aperiam non ipsam aut fugiat odit illum est nisi sit odio praesentium omnis labore incidunt reiciendis hic qui numquam at occaecati autem fuga corporis dolores repellendus aut voluptatum reiciendis consequuntur voluptas nisi dolores culpa velit aut aperiam aut doloremque ut ut velit aut fugiat commodi in architecto odit error id cumque sed accusamus non rerum enim ut atque perspiciatis pariatur et omnis nam voluptatem eos similique in et asperiores sint enim sed sit sit est tempore sed vel odit sit dolorem dolorem blanditiis doloribus ducimus voluptas incidunt amet velit nihil ut eligendi optio et rem possimus perspiciatis libero iusto est eum facere in a porro rem voluptates iure culpa sapiente amet aliquid tempora maiores totam doloremque aut dolor quidem ut cum quas aliquid quos omnis neque praesentium qui sit illo repellendus id repudiandae officia maxime sed ducimus occaecati dolore non corporis tenetur est dolorum sint in sint quibusdam velit maiores at eos quibusdam a quis sit ut consectetur aliquid facilis et voluptas quis ea est.', '1', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('654', '2', 'Architecto aut vitae saepe est quaerat.', 'Aliquam laudantium mollitia voluptatem est ducimus quo pariatur culpa nihil et dignissimos ullam consequatur nemo sit temporibus architecto qui consequuntur id aliquam eligendi harum sint molestias neque omnis deserunt possimus accusamus quisquam qui aut nemo laborum officia ea inventore vitae nihil delectus occaecati aspernatur ipsum consequatur dolores voluptas non explicabo nesciunt autem illum quo voluptate deleniti quia praesentium qui nesciunt cupiditate soluta veniam totam libero voluptas quisquam eum nihil nihil in ut quisquam amet ut enim eaque est et magni expedita et aperiam hic qui eligendi non sed deleniti ut iste voluptas magni tempore aut consequuntur laborum sunt quos officiis quos dolor eius animi aspernatur in dicta velit illo hic ut earum libero blanditiis sunt tempore aspernatur sit consequuntur cum et aut enim velit distinctio unde quia rerum voluptatem velit omnis dolorem et consequuntur voluptatem amet magnam incidunt quo neque ut est necessitatibus dignissimos deserunt necessitatibus odit quia et nulla eum unde cumque aut quae dolores eaque ut sunt asperiores corporis quisquam quos error voluptas labore sed cum alias consectetur voluptates sapiente eveniet repudiandae voluptas aut qui quo non fugiat aliquid ex necessitatibus autem repudiandae quis illo est repellendus provident eos et ex molestias distinctio assumenda deleniti vitae praesentium quo rerum numquam occaecati in quae eos itaque veniam quo qui occaecati corrupti amet molestiae omnis perferendis voluptatibus voluptas voluptatem totam veritatis repudiandae aspernatur in accusantium ab omnis consequatur ullam pariatur harum quam voluptatem maxime non est nostrum commodi placeat dolorem cum veniam consequatur velit corporis accusamus suscipit deleniti eaque quasi occaecati sequi consequuntur mollitia et itaque et distinctio praesentium voluptates est nemo ut sint facere quam sed in deserunt non a