INSERT INTO `course_news` VALUES ('655', '4', 'Eligendi ut eos ab sapiente.', 'Molestiae et et id id omnis veritatis suscipit enim natus adipisci minus tenetur voluptatibus id a animi esse maxime necessitatibus amet fugit sequi qui sequi ullam magnam consequatur deleniti dolor quia rerum molestias quo maxime eum quis architecto sed voluptates sit neque aliquid rem ratione at ex qui facere et distinctio ex saepe unde delectus hic blanditiis neque minima aut cumque beatae iure eaque et beatae magni perspiciatis quam ex cupiditate dolores quia ipsam incidunt rerum incidunt aut possimus quia ut ea veritatis aut voluptatem magni iusto et fugit suscipit nemo consequatur est ea suscipit aut facilis aliquam esse voluptate debitis dignissimos quo dolore beatae fugiat voluptate sed qui omnis odit et at ratione id excepturi et facere sed nobis quod consequatur omnis aut culpa officia cupiditate voluptatibus aut vel placeat dignissimos ipsa earum temporibus voluptas impedit quia sunt debitis nostrum ut totam et necessitatibus recusandae repellat tempora magni et eos beatae sint a id omnis rerum fugiat voluptates et voluptate eum aperiam eos similique eius exercitationem odio explicabo quaerat iste ipsam officiis rerum iusto dignissimos veritatis quidem eos ea sit magni magnam vel quisquam natus nesciunt officia distinctio et perferendis omnis explicabo aut et repellat illum id ut qui dolores nesciunt vel laboriosam minus eveniet labore nihil eos natus quidem.', '1', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('656', '2', 'Aut doloremque quae quidem aut blanditiis et.', 'Aspernatur nemo amet consequatur iure aut maxime omnis eum tenetur cum eveniet hic sapiente libero consequatur sunt est aut et voluptatem dolore rem culpa voluptate impedit cum sint quis minima accusamus maxime nisi consequuntur libero tenetur cum consequatur inventore in voluptas aut blanditiis quisquam magni libero perferendis sint et ea ea praesentium aut et iure id provident esse itaque sed laudantium sit facilis maiores nesciunt quas quaerat exercitationem rerum maxime et aut at numquam vitae totam eaque tempora iure labore aut qui ipsum eos aut assumenda eum numquam esse fugiat rerum facere voluptates maxime ab quia ipsa voluptatem nostrum id exercitationem qui nemo voluptas dolorem sapiente ut ut dolore mollitia quisquam autem minus repellendus illum vero sint saepe hic neque doloribus eum perferendis hic reprehenderit tempore aut hic harum cupiditate dicta quam sint ut modi sit sint sit illum et sed omnis eaque sequi deserunt soluta facere tenetur natus et fugiat sed quaerat sit consequatur quo architecto itaque assumenda facere dolor omnis perspiciatis perspiciatis nihil est autem non nihil exercitationem dolor et aut sit repellendus a accusantium enim ea accusamus veritatis odio numquam ullam aut tenetur molestiae iste consequuntur omnis quis repellendus magni veniam omnis quae deserunt eligendi repellat id molestiae omnis placeat maiores nemo aut est consequatur doloribus vel consequatur et soluta doloribus id et similique aperiam quaerat non quia rem mollitia ratione voluptatem accusamus fugiat qui hic.', '0', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('657', '8', 'Ipsum minima in inventore quas nobis doloribus.', 'Mollitia ab aut velit explicabo et sed at neque et veritatis voluptatem laborum quasi voluptatem beatae optio porro natus repellat aut ut sed dolores est omnis aperiam ratione repellat mollitia quo nostrum perspiciatis rerum iste eius mollitia commodi unde nam suscipit accusamus quisquam atque necessitatibus eaque id adipisci totam tempora sapiente possimus sit qui dicta ut et nam repellat fugit porro magni aliquid cupiditate aut nihil provident aliquid aut quia corrupti ipsa id ea et sed nihil dolores cumque fugiat animi pariatur et dolore non qui dolorem assumenda harum iste quisquam odit fuga qui ad recusandae consectetur est cumque illum labore voluptatem reprehenderit sed et voluptatem architecto ut dolorem id odit doloribus fugiat sint eius occaecati aliquid laboriosam placeat laudantium odit excepturi impedit rerum consequatur blanditiis mollitia debitis illum eos et esse voluptatem omnis sequi hic quia dolore officia beatae reprehenderit cumque dolorem voluptas animi consequatur quam porro et dolor vitae laudantium dolores libero expedita reiciendis ut tempore et possimus quia vitae eaque voluptatem perferendis amet quasi aliquam architecto est est dolore deleniti quae quos eos dolore inventore quaerat vel voluptatem commodi dolorum odio incidunt sapiente quae aliquid voluptatem vitae asperiores perferendis iste quasi aut dolorem illum tempora laborum nobis consectetur autem qui quia nihil nobis molestias eaque et praesentium aut eaque voluptatum est est iure occaecati eius et id minus assumenda et omnis repudiandae ratione et quos et quisquam minima libero eum fugiat illo harum nesciunt ut in quia totam delectus unde voluptatum ea quas quas tempora cumque magni temporibus consequatur corporis nam est molestiae numquam dicta sequi fuga numquam sequi in nemo totam.', '1', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('658', '6', 'Et dolorem delectus quia ea sed dicta.', 'Necessitatibus cupiditate est minima illum consectetur consectetur consequatur sed similique rerum blanditiis est quas ut illo rerum illum et laboriosam eos quae earum at libero dicta quod aliquam aspernatur voluptas est nesciunt nulla ducimus modi quod vitae quaerat expedita aut ex harum perferendis in omnis consectetur esse et optio non repudiandae earum voluptate illo incidunt id esse voluptatibus cum qui vero voluptates non dolores a eligendi laudantium qui excepturi autem ratione ratione doloribus cum exercitationem vel eum amet est magni error soluta sit odio laudantium beatae reprehenderit nesciunt alias aperiam necessitatibus veritatis optio tenetur debitis non dignissimos ea et doloremque recusandae quo est vel consequatur optio quos sed a perspiciatis officiis ut a facilis voluptas nisi nemo non reiciendis est veniam natus perferendis nobis natus dolor laborum sit porro distinctio id suscipit vel voluptatem voluptatibus ratione animi iste ut quia qui quo iure possimus eum autem odio odio a consectetur eligendi minima ea natus laboriosam quas dolores eaque soluta hic blanditiis perferendis eum voluptatum corporis inventore et accusantium voluptatem iusto exercitationem quas cupiditate odit architecto unde est facere et qui non et non corporis est sequi quae officiis tenetur natus doloremque et placeat non libero rem aut quo alias harum modi iure dolores sapiente eaque aliquid ad blanditiis numquam laudantium iusto saepe eos eos illo quo id dolores voluptatem quibusdam ex dolore enim omnis atque non neque a aut accusamus et dolore doloribus minus nihil consequatur modi ut quisquam laudantium et qui enim expedita nihil in et qui at nam aut architecto sit sunt veritatis est dolor aut sed et omnis saepe ducimus voluptates incidunt magnam et et placeat libero et reiciendis inventore enim vero dolor velit.', '0', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('659', '6', 'Non sint itaque aut dolore non.', 'In facere esse atque ut delectus accusamus impedit voluptatem ab cupiditate est ut recusandae animi ratione suscipit repudiandae ea nisi aut debitis incidunt aliquam consequatur corporis corrupti qui adipisci asperiores eos deserunt mollitia rerum non praesentium ea quis enim dignissimos sint deleniti illo qui et blanditiis dolor unde consequatur quibusdam et beatae ducimus cupiditate harum quam unde ea ut fugiat qui voluptas numquam quasi facere eaque id fuga est nulla beatae aut in nulla et et voluptas veritatis non in ea sit nam sint architecto quo dolores eligendi et in ipsa ut enim pariatur expedita tempora autem hic enim magnam fugit magnam veniam error voluptatem et esse dolorem aut eligendi tempore velit ipsam molestiae qui quos et asperiores numquam quo qui quis sint voluptates nihil numquam dicta vel soluta dolores doloribus laudantium facere illum dolore ipsam temporibus ex dolorem recusandae ratione officiis dolor dolore facilis nesciunt quibusdam atque sit aut eum excepturi ipsum maiores quibusdam quia quia assumenda maxime eos est quis facilis sed sequi omnis voluptatibus optio velit commodi est voluptatibus voluptate qui velit atque consequatur molestiae ab illo quia ea culpa facilis neque eos pariatur aperiam modi odio accusantium sint quaerat non libero ullam cumque repellat vel et occaecati eum adipisci sit est dolores sunt enim commodi aliquam possimus ut dolores consequatur et soluta voluptatibus sint sapiente tempore eum est nihil nemo laboriosam quod sequi officia eum.', '1', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('660', '3', 'Accusamus excepturi provident voluptatibus dignissimos laudantium aliquid tempore.', 'Laudantium recusandae temporibus harum earum quam voluptatem minima autem ut nesciunt eveniet minima ipsum autem placeat doloribus est sed maiores assumenda autem culpa alias laboriosam sed harum et dolore et sed ut voluptas fuga reprehenderit qui ex voluptatibus sed corporis magnam illo velit velit aliquam qui pariatur explicabo atque ut ea incidunt similique cum quos quasi dolore esse est fuga ut placeat quaerat ab modi necessitatibus consectetur quas soluta reprehenderit aliquid porro voluptatum eum aliquam corrupti voluptate sed doloremque quaerat odio quisquam dolores eveniet veniam magni maxime vero ea illo aut voluptate et doloremque voluptatem fugit sit nihil tempore velit aut eius quo nam ab autem optio consequatur et placeat neque nulla sed temporibus aut sunt quasi suscipit aut soluta perferendis necessitatibus nesciunt molestias et possimus omnis ut reprehenderit neque consequuntur et magnam ab esse voluptas et ducimus suscipit esse id voluptatem voluptas qui unde sequi fuga qui voluptatem labore tenetur nam distinctio qui quisquam enim minima corporis est pariatur consequatur commodi sint laborum repellendus quas et quia et ipsa ut amet omnis optio et qui enim aliquid omnis maxime aliquam modi dolorum esse est sed ut perferendis eum laudantium perspiciatis est dolor adipisci itaque cumque ut ullam ut dignissimos corporis provident temporibus esse totam voluptas iusto ut ab id et dolorem accusantium ipsa vel voluptatem voluptates quae dicta quasi provident enim iure aut facilis illo beatae ut dolorem ipsam sed in consequatur quia iure non error cumque facilis impedit vitae quo qui autem ut ipsum harum qui quis ut eaque neque laborum molestias occaecati molestias quo beatae tenetur amet dolores error voluptas aut vel aut voluptas quia temporibus laudantium sequi deleniti qui et labore debitis est excepturi qui tempore molestiae molestias perspiciatis ex dolorem ipsam rem ut amet ex architecto ut provident harum qui qui nam non consequatur et ea rerum cumque facilis ut ipsum tempora unde repudiandae adipisci quas mollitia molestiae reiciendis impedit tempora facilis mollitia ratione sit labore error perspiciatis pariatur rerum dolores delectus soluta illum fugiat ipsa reiciendis asperiores aut nemo et quia fugit repudiandae modi sit suscipit tempore veritatis fugiat porro similique blanditiis occaecati eligendi dolorem in quis maiores eos veritatis voluptatum inventore quae magnam aliquam veritatis quae enim autem minus dolor odio iste illum ut eum molestiae.', '0', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('661', '5', 'Quibusdam asperiores eos error amet at quae adipisci.', 'Explicabo illum et adipisci et ex occaecati aperiam debitis magnam cumque voluptate architecto ut esse rerum occaecati in officiis quo voluptatem quod dolor et hic suscipit dicta libero quis et voluptates voluptatem aspernatur molestias aliquam voluptatem quasi pariatur at dignissimos voluptatibus porro labore ut est voluptatem voluptatum ut nostrum accusantium qui eveniet eaque quos facere quia ratione laboriosam laudantium enim ex voluptatem qui est nihil et sapiente facere quam consectetur inventore autem qui a dignissimos voluptatem quibusdam non libero et quod dolore mollitia qui deleniti earum autem neque aut vero fuga placeat culpa est dignissimos rerum reprehenderit sed nobis atque optio sit pariatur voluptatem nulla aut aliquid dolores consequuntur voluptate earum quasi suscipit quibusdam rerum aperiam excepturi ab et ut provident quo harum non non ut explicabo eos rerum aut ad error aut voluptatem optio est dolor quo qui minus tempora repellendus nihil quam voluptatem animi magni sunt iusto id neque quia rem provident voluptate non laboriosam harum ratione rerum quod numquam id quis in consequuntur aspernatur quidem excepturi officia unde non eius corporis saepe et quod exercitationem sit dolorem odit cupiditate ratione perferendis consequatur eveniet natus commodi est et qui culpa aliquid velit ea qui rem et facere voluptas eum fuga dolorem dolores rerum dolor alias earum velit incidunt omnis possimus deserunt ea aliquam ut hic pariatur aut quia eum sit temporibus occaecati ut consequuntur suscipit non maxime voluptatum a et quaerat quod sed exercitationem deserunt et corporis iusto est et itaque soluta dolores dolores sit aut fugiat optio voluptatem quod fuga aperiam aut dolorum quasi est aut rerum quia sed et nulla itaque et sunt veritatis odio nemo esse assumenda eos fugiat alias est culpa distinctio ut aut illum voluptas earum aperiam rerum voluptat