INSERT INTO `course_news` VALUES ('662', '6', 'Tenetur et ipsam id.', 'Doloribus itaque consequatur est id magnam recusandae libero voluptas in cumque ut mollitia voluptatem soluta accusamus et a et minima deleniti ab eaque qui ut cum saepe ullam qui porro ducimus ipsa consectetur aliquid adipisci praesentium amet corrupti nam vel quos qui quas qui quia dolor et sint omnis alias maxime dicta tempore labore numquam quaerat aut dolores ea architecto dolorem iure autem autem culpa expedita consequatur nemo laborum voluptatem aut vitae rem consequuntur magni odio ut ut aut eaque et quod dolor nobis debitis nostrum temporibus voluptatem quos magnam cupiditate odit vero iste reprehenderit voluptatum aliquid sunt eius eaque quis possimus officia nisi velit veniam quis voluptatem quia ipsam est praesentium dolorum libero sint omnis nemo sunt aut eum doloremque aut eos optio illo maiores in quasi dolorem sed et esse commodi aliquam ducimus praesentium dolorem eaque eum et asperiores velit aut perferendis error et temporibus qui non quam iste totam suscipit autem veritatis veritatis repudiandae animi sunt ut quibusdam laboriosam quia distinctio est corrupti ipsam similique excepturi ut quos qui aut iusto doloremque modi vero quia nam aliquam esse aut repellendus consectetur dolor et aliquid neque aut odit adipisci voluptate voluptatem distinctio est est aut eligendi maiores perspiciatis neque eligendi consequatur facilis sed autem quibusdam quia magni dolores praesentium beatae ipsum laboriosam dicta nihil sunt omnis modi qui sit officia tempore aut quis maxime cum illo rem.', '1', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('663', '6', 'Accusamus non veniam autem.', 'Unde saepe reiciendis at sit aspernatur velit eum eveniet mollitia similique ipsum aliquid laboriosam illo perspiciatis id delectus fugit nihil neque hic quos consequatur at qui dolor et dolor enim est officiis dolor repellat corporis sint sed voluptatum blanditiis omnis ab praesentium eligendi ducimus et voluptatum minima a similique molestiae reiciendis dicta enim magni blanditiis illum natus nisi quam sed repellendus quis et et sed voluptatem sed non consectetur labore porro inventore aliquam aspernatur maiores aut dolorum sit omnis labore ab iusto consequuntur repellat ut quis exercitationem numquam ut recusandae adipisci natus eveniet dignissimos vel eveniet officiis quos iure quia tempore et incidunt voluptatem reiciendis qui ducimus corrupti ratione voluptatem eligendi earum quia facilis enim autem quam modi aliquid soluta ullam libero quis nisi perferendis modi repellendus sit sint nihil omnis quasi quam dolor possimus velit saepe aut quibusdam dignissimos distinctio excepturi fugiat voluptatem omnis eum vitae architecto dolorem sit neque rerum ipsam voluptatem est exercitationem sequi sit quia nobis numquam cumque dolorem eius voluptas facilis doloremque ut a est ut reiciendis quam similique voluptas inventore voluptas incidunt numquam cumque distinctio laudantium tempora non est ipsum placeat rerum veniam quaerat rem ut recusandae reprehenderit modi voluptatum quis delectus voluptatem quo et ut aut aut a iure et repellat possimus eum tenetur dignissimos voluptas eaque dolor et sunt.', '1', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('664', '1', 'Sint voluptatem soluta in esse vel iure.', 'Et quis recusandae cum molestiae velit eos corrupti ipsum sequi animi harum fuga repudiandae vero totam aspernatur occaecati temporibus occaecati cupiditate quidem itaque qui quis officiis suscipit hic suscipit soluta optio qui et sunt et aut dignissimos corporis et aut explicabo in perferendis minus quia eius voluptate qui laudantium reiciendis debitis ex adipisci culpa quaerat ducimus aut aperiam voluptates et sit earum quia assumenda modi eum reiciendis animi veniam sit hic est explicabo provident ut vitae libero reprehenderit veniam impedit provident aut tenetur inventore quis qui sed totam ullam consequuntur natus excepturi accusamus praesentium perspiciatis modi voluptatem numquam amet error magni reprehenderit explicabo ab omnis omnis aut saepe qui molestias quibusdam hic et illo illum nesciunt repudiandae sed necessitatibus ut ad ea quia ratione blanditiis repellat et et autem omnis suscipit magnam dicta eos non ipsam ex et et inventore temporibus recusandae esse a et corporis quis voluptatibus et molestiae sunt labore natus repellendus consectetur quae pariatur culpa sed ut accusamus alias voluptate voluptatum amet atque deleniti totam ut ad et reiciendis quod et voluptatibus in dolore et veritatis sit harum asperiores ut sequi tempora dignissimos quasi nam minus dignissimos voluptatibus fugiat nihil deserunt ut ea ea maxime iure repellendus fuga voluptate ullam aliquid consequatur enim nulla hic magni iste ducimus ea magnam enim fuga excepturi vitae natus molestiae nihil qui provident repellendus et ratione in at dolorum itaque nostrum totam dolore vel error repellat quibusdam quia harum omnis quas in fugit veniam voluptatem necessitatibus cupiditate est quaerat dolor aperiam enim voluptatem ad et nisi nostrum rem quia et dolor consequatur maiores voluptas omnis fugit architecto ipsum sit ipsa quae accusamus et enim quod dicta ut consequuntur ut voluptatum possimus r