INSERT INTO `course_news` VALUES ('665', '6', 'In consectetur dignissimos qui a dignissimos.', 'Culpa dicta voluptatem dolorum velit ipsa tempora dolor hic iure rem et nesciunt dicta magnam et aut repudiandae qui iure eum qui possimus beatae qui tenetur necessitatibus voluptates sit quod qui nihil tenetur explicabo ut aut fugit animi omnis consequuntur omnis accusantium sed eveniet expedita voluptates qui quas et rem cum minima alias aut excepturi magni eveniet veniam quo deleniti molestias odit accusamus unde fuga autem voluptates et voluptatem eaque ut sequi doloribus sit optio ratione eos aut et est perferendis minus velit animi deleniti nesciunt qui in fugit placeat provident aliquid quasi officia velit sed vel voluptatem blanditiis laudantium atque ut occaecati earum iusto similique quo omnis nihil fugiat totam et et aut sequi hic dolorem quis sapiente nihil rerum aspernatur fugiat itaque dolorem aut culpa non mollitia vero enim eos qui quam quo reiciendis voluptas amet quas molestias eos veniam maiores sed perferendis rerum quibusdam ipsum est rerum amet veritatis et culpa dicta ea eos blanditiis qui consequatur dolor enim commodi dolore eum facere in nostrum illo accusamus ducimus est eaque minima autem corporis consequatur optio quo officiis quod sint non et sit molestiae perferendis ad dolores quibusdam ut dicta consequatur et dolor voluptate.', '0', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('666', '2', 'Omnis sed non sint odit dignissimos laboriosam.', 'Aut itaque a adipisci nihil culpa ut dolores eum cupiditate distinctio ut fuga aut doloremque et atque odit suscipit omnis provident quas sint dolores ut omnis maxime molestiae sed occaecati est ut totam sit impedit non quis eos et unde in tempore ratione sunt quia fugiat et numquam qui sapiente qui quo doloribus mollitia sequi necessitatibus sed facere corrupti ea tenetur corporis iste ut quia dicta facere suscipit laborum et dolor vitae voluptatibus qui dolorum aut occaecati nisi vel enim assumenda fugit earum est iste ut consequuntur cupiditate fugiat asperiores nihil voluptates molestias aliquam at ratione consequatur dicta sed porro molestias libero et magnam velit nemo porro quae tenetur illo neque pariatur est quia dolor similique aliquid perspiciatis harum omnis explicabo et nemo et quae aspernatur veniam sint facilis eum in distinctio dignissimos tenetur optio iusto voluptas maiores ut ut quam qui numquam velit reprehenderit est sapiente placeat eligendi perferendis voluptas tempora ut eos ipsum at rerum omnis necessitatibus optio voluptates et minus quae sint deserunt unde aut laboriosam deserunt nulla beatae sint sit expedita est sunt eos sunt autem consequatur fugiat illo excepturi quis numquam at dolorum et praesentium illum corporis ex aut delectus temporibus maiores dolorem ut nam assumenda quia minima voluptatem soluta dolore rem eligendi fugit officia vel sunt illo quia.', '0', '2017-05-02 22:59:23', '2017-05-02 22:59:23');
INSERT INTO `course_news` VALUES ('667', '10', 'Voluptas nisi dignissimos culpa enim.', 'Illum at sunt libero architecto nesciunt velit illum molestiae non ipsam rerum expedita autem voluptatem repellendus rerum unde voluptate ut reprehenderit debitis quia eveniet magnam cum esse tempore sed est doloribus accusantium ex minus mollitia corrupti repellat voluptatem ullam vitae alias id facere asperiores ducimus aspernatur voluptatem aut a dignissimos officia quibusdam reprehenderit aut ullam nihil natus nulla sed perferendis nostrum animi vel rerum nihil exercitationem qui quod omnis enim quis iste reprehenderit ullam enim ea rerum cumque odio ea commodi optio quos dolorem totam ea atque in consectetur veritatis est sunt dolores distinctio repellendus modi et est molestiae nihil unde dolore dolor velit cum animi ipsum molestiae saepe earum esse saepe ad sint et id id aut iste consequatur laborum nesciunt perferendis tempore perferendis libero enim temporibus modi aspernatur eum et repellat et unde harum veniam qui assumenda est aperiam animi illo eligendi ipsam eos magnam esse sint inventore qui maiores voluptatem natus et quam ut est ut atque id non autem earum eos nemo quaerat amet aut corrupti cum asperiores aperiam aspernatur molestiae ipsam voluptas maxime facilis dolorem aut sequi error occaecati maiores porro consequuntur quidem ut non dolorem adipisci ut harum dignissimos iusto officiis provident qui magnam asperiores reiciendis enim iste sint modi nisi aut consectetur eum molestiae aut aut dolores totam corporis earum vel eum vel odit nemo molestiae sapiente et aspernatur sit et quas quae omnis commodi dicta repellat autem sint eligendi dolorem aut aliquam non quia dignissimos ab eligendi et a iure qui libero veritatis sapiente dolorem odit dolorem asperiores voluptatem doloribus et molestias asperiores magni omnis quo labore velit omnis repellendus hic assumenda omnis qui ratione natus architecto ex reprehenderit voluptas velit et accusamus veritatis natus sapiente et nobis voluptatem ex perferendis repellat nesciunt omnis amet saepe sapiente sunt aut maiores omnis quos dolorem et facere reiciendis tempore repudiandae quaerat corporis voluptatem rerum voluptatem ab quas earum animi magni sed deserunt atque ea et voluptas est est aperiam eligendi eligendi labore officia quas voluptatibus adipisci atque omnis est ut aut est eaque pariatur sunt incidunt porro voluptatem et voluptate atque quia reiciendis dicta voluptatem laudantium ut magni hic quia quaerat hic voluptatem quaerat quis doloribus adipisci reprehenderit tempora officiis explicabo vel voluptate nam earum laborum earum numquam ut cumque ut laudantium eligendi totam blanditiis in omnis officiis inventore qui voluptatem nulla vero molestiae quis assumenda minima quam voluptate quo dolorem eos dicta dolorum rerum ducimus sit et non earum voluptatum qui enim quod similique nam inventore nemo est.', '0', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
INSERT INTO `course_news` VALUES ('668', '10', 'Molestiae eaque quasi magnam magnam ut eius.', 'Fugiat a ea amet dolorem fugiat et harum alias enim magnam sint qui inventore error ut odit animi est ea enim sunt explicabo dolores provident nihil est excepturi tenetur qui et qui soluta animi est aliquam molestiae quia eius labore iste eveniet fuga quaerat quisquam cum quia eos commodi dolor aut neque et nostrum qui ratione debitis et sapiente facere perspiciatis ut assumenda suscipit est laudantium id aliquam accusantium laborum id voluptates soluta aspernatur voluptates non hic quia natus impedit voluptas neque laboriosam soluta quaerat officia dolore odio unde recusandae aut molestiae voluptatem aperiam cumque qui et fugit quis id voluptates sint tempore sed eius nihil dolores voluptate repellendus magni corrupti molestias dolorum voluptatum aut eos aut sapiente occaecati amet facere velit aut voluptas dolore numquam praesentium expedita ipsa at mollitia qui harum aliquam incidunt dolores nihil culpa quas et illum quia deserunt cumque dolores dolorem quia molestiae quaerat excepturi facilis qui dolorem quod ut deserunt voluptas ut aspernatur ut dolor nisi iure repellat molestias aut qui molestiae soluta praesentium ducimus expedita quo est iusto sit molestias et consequatur dolor facere atque voluptas doloribus in reprehenderit consequatur cupiditate expedita sequi qui voluptatem ut labore eum voluptatem dolorum ut qui incidunt incidunt tempora temporibus eum sit quidem nihil voluptas ea sint eveniet animi fugit ea eligendi laudantium aperiam iure pariatur deleniti recusandae expedita sed et occaecati praesentium officiis et odio voluptatem animi vel facere placeat voluptatem quis cupiditate velit atque et tenetur ab numquam rem nam et magnam doloribus ut maxime vero autem dolore dolores veritatis facere est omnis odio iure provident qui et autem repudiandae optio in ut.', '0', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
INSERT INTO `course_news` VALUES ('669', '1', 'Mollitia sequi qui possimus sit placeat.', 'Iusto blanditiis qui similique quidem corporis rerum aut quis sed quo sapiente laudantium alias est vel occaecati soluta quia omnis omnis non et omnis eum reiciendis animi nam qui veniam dolorem nostrum repellendus fuga ipsum dolor exercitationem sit aut alias quia nulla dolores quam aut ducimus enim omnis repudiandae nihil facilis voluptatibus doloribus illo dolorem sit neque nulla consectetur sunt fuga quos quia sapiente temporibus deserunt cupiditate architecto officia nihil est perspiciatis debitis et sunt at reiciendis at fuga rerum aspernatur quisquam et molestiae qui quia consequuntur et autem et a provident quisquam nulla eligendi in praesentium est qui saepe qui quia cumque voluptatem modi ut aliquam est quia dolor deleniti quis vitae quod suscipit nemo optio provident non rerum est illo ullam unde earum qui inventore iusto voluptatibus blanditiis voluptate sequi rerum animi earum error quaerat ut illum rerum harum tempore debitis ut quos quia qui ullam saepe voluptatem commodi et dolores reiciendis adipisci voluptatem beatae ex labore excepturi quis a cum et officia deserunt iure explicabo temporibus culpa quidem ut animi minus incidunt id nemo voluptatem illum mollitia sunt quo iusto et dolorem est nihil voluptate eos laudantium quae doloremque quia est doloribus nihil.', '0', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
INSERT INTO `course_news` VALUES ('670', '7', 'Neque nesciunt non tempore exercitationem expedita distinctio sed.', 'Dignissimos vel rerum sunt quia aut ad voluptatem praesentium magnam vel aut fugit ea a saepe tenetur dolorem repellendus omnis animi hic et saepe voluptatem dolores illo et ipsam deleniti illum mollitia rerum libero perspiciatis excepturi rerum excepturi expedita voluptatibus dolorem repudiandae nostrum amet sequi vitae perspiciatis provident dolor asperiores doloremque aut totam ducimus quasi id dolor libero quo quos laudantium architecto nisi incidunt nam qui illum autem est aliquam molestiae facere consectetur amet sed quidem sunt rerum ab velit magni repudiandae non ex alias non sapiente earum dolorum earum quod accusantium placeat consequatur ut similique doloribus eos non nemo nesciunt sunt iusto expedita voluptatum tempora non et illum cumque iure est expedita et et nobis similique est nostrum voluptas blanditiis accusamus vel sit et nemo atque recusandae qui blanditiis esse ex accusamus molestiae qui quia voluptatem autem doloribus voluptatibus ut corrupti velit amet aliquam soluta et modi est consequatur qui ut ipsam molestias non nam quas quae sed aut tenetur ratione voluptatum esse consequatur sit quis magnam dolorum omnis sint itaque vitae voluptas nostrum temporibus sed eaque similique deserunt veritatis ipsam qui vel rerum placeat velit unde quaerat quo earum vero dolorem et dicta est est consectetur soluta rem debitis omnis natus dolorem illo at hic quo velit qui voluptas accusamus animi quis omnis ducimus enim esse corporis sint rerum unde sunt quis veritatis alias itaque qui aut et ut sed magni fuga sit est voluptatem assumenda debitis quo iusto consectetur ut eveniet aliquam aut inventore autem aut et quia itaque autem inventore fuga iusto quos nulla accusantium repudiandae quo quae occaecati velit cum perspiciatis voluptatem ex tenetur distinctio nobis nostrum aliquid voluptatem quidem odit rerum quis sed dolorum nam accusantium te