INSERT INTO `course_news` VALUES ('671', '8', 'Et magnam numquam a et id eos rerum eius.', 'Voluptate excepturi repudiandae commodi earum dolor amet saepe ducimus accusamus voluptatem dolorum explicabo nihil ea impedit quod ipsa et iure quasi odio vel eaque quo iusto ipsum nostrum laudantium culpa quo exercitationem ut veritatis earum tempore non laborum libero magnam dolore quam consequatur asperiores voluptatem delectus dolor architecto tempore vel et aperiam aut laborum et nam labore et consequatur qui ullam ut ut laboriosam sit officia consequatur officiis et quidem asperiores et veniam sint alias laudantium consectetur labore voluptas eum voluptatem tempore sunt quis mollitia quis commodi aliquid tempore molestiae soluta quo omnis aliquam quo sunt ipsum sint ea perspiciatis est iusto ullam fugiat maiores quaerat sit aspernatur odit qui voluptas ut illo qui nesciunt facere enim culpa odio nemo est dolorem ut est molestiae repellat dolores libero ut reprehenderit voluptatem ut quia molestiae totam est itaque aut ratione eum eligendi repudiandae voluptatum assumenda ratione et ex enim ut ipsam sint dolorum voluptatem qui veritatis autem eaque tempore est amet atque nisi fugiat voluptates a dignissimos rerum voluptatem beatae architecto id nihil rerum ipsum qui veniam sit atque nisi soluta architecto similique non aspernatur sit voluptatibus et rem maiores autem magnam qui voluptas vitae ut non a quas eos cum sed perferendis laboriosam iure neque omnis eos eaque libero placeat molestias id molestiae sed sunt ab architecto soluta occaecati atque maxime voluptas beatae placeat et modi.', '1', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
INSERT INTO `course_news` VALUES ('672', '10', 'Vitae enim voluptatem sed voluptatem est.', 'Quas quia dolores dicta ut rerum quod voluptatibus et voluptas quo excepturi ad modi aperiam et debitis rem id sed consequuntur fuga rerum velit enim quia doloribus modi doloribus ea est repellendus adipisci incidunt error cupiditate dicta provident qui enim doloremque voluptatibus quae maxime autem in laborum corporis deleniti ex ut ut sequi omnis ullam qui nesciunt odio et occaecati quaerat autem accusantium laborum iure ut voluptatem dolore facilis quisquam nisi aut consectetur qui laudantium fugiat qui perspiciatis in eligendi quo dolores nemo voluptatem aliquid repudiandae nulla ab itaque provident doloribus voluptates ut et itaque assumenda commodi minima placeat odio et a pariatur eius ut dolor rem consectetur laudantium dolores ab eos nesciunt delectus placeat voluptatibus sit autem enim debitis itaque enim rerum voluptates quo vero ipsam occaecati deleniti est iste quae adipisci quasi minima tempora et optio ipsum dolorem totam distinctio omnis facere laboriosam nam enim veniam voluptas id odio adipisci sit nesciunt vitae maiores dolor commodi quia voluptatem velit laborum quaerat amet omnis ut occaecati exercitationem sunt esse consectetur hic eligendi est id est pariatur nisi vel officiis earum laboriosam mollitia sit officiis iste possimus rerum magnam dolorem deleniti necessitatibus veritatis porro vel enim molestiae ut consectetur qui sunt earum expedita distinctio accusantium unde fugiat laboriosam rerum modi reprehenderit ea deserunt quam voluptatibus similique omnis repudiandae laboriosam velit aut sit quia eum blanditiis voluptas beatae dignissimos atque provident numquam ratione minus et amet qui corrupti consequatur enim voluptatem earum est neque sed sapiente consequatur ducimus aliquid nostrum eos esse est mollitia labore id eius et omnis sint accusamus natus quisquam voluptas explicabo sed commodi sed voluptas maxime quas voluptas officiis eius delenit