INSERT INTO `course_news` VALUES ('673', '3', 'Et repellat vel commodi eaque aut eligendi.', 'Aut ut voluptates tempore quis quia et ea aliquam mollitia molestiae distinctio molestiae dolores eos dolorem eius quis sint tenetur numquam aut dicta deserunt quidem at rerum eos earum qui ullam ipsum magni ut repudiandae consectetur enim quam voluptas aliquid vel pariatur similique molestiae qui sint quae minus culpa consequatur doloremque laudantium mollitia quo aut atque rerum et ducimus laboriosam eum nihil est iusto recusandae minus itaque possimus recusandae ipsa natus enim ut veritatis vero aspernatur repellat esse veritatis magni rem rerum nihil rem tempora eveniet et sequi et et porro qui consequuntur quam fuga nisi ut qui dicta autem quidem voluptas qui quibusdam veniam qui placeat nostrum ex quos dignissimos culpa doloremque ex repellendus qui dolor dolores dolore ut sed ratione veniam dolores eaque ad dolore rerum ut sit explicabo aut voluptas quis accusamus itaque nesciunt ut accusamus quo architecto sint repellat totam voluptatum omnis iure numquam vero numquam perspiciatis consectetur repellat et dolores sapiente aperiam ut quo sed odit vero odio numquam eaque perspiciatis temporibus possimus ad omnis qui earum atque voluptate non id qui neque consequatur laborum asperiores doloremque quasi nobis quis ab aut.', '1', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
