INSERT INTO `course_news` VALUES ('675', '6', 'Eligendi sed aliquam consequatur vitae consequatur.', 'Porro quae vel sint libero cupiditate perspiciatis quae voluptates dolorum ipsum sequi consectetur ipsa suscipit quos aut quia in velit quia asperiores unde eos atque dolor incidunt quis provident voluptates asperiores aliquam eum maiores alias animi beatae hic sunt id facere ex expedita expedita quasi nihil et reprehenderit ut ex iusto ducimus aut qui nesciunt minus ut laborum ipsam pariatur ex perferendis deleniti molestiae dicta aut nam laborum quis temporibus in distinctio laboriosam consequatur numquam consequatur nostrum eligendi nobis accusamus quia distinctio cumque non aut consequatur veniam officia quod quidem ea eaque rerum nemo delectus consectetur ut porro quia quae dolor asperiores a cum tenetur esse aut iure nisi quas eius et temporibus impedit quod earum corporis ducimus molestiae consequatur harum molestiae est ipsam commodi accusamus consequatur repellat aut ab est quis molestiae et minus error eum et eum consequatur occaecati quia voluptas doloribus provident harum inventore aut qui dolore id in id sunt quasi est officiis amet voluptatem iste molestiae ut non sed a veniam animi ut consequatur dicta et adipisci molestiae eos accusantium quidem quia eos quisquam numquam repellat ea ea magni sint et fugiat saepe doloribus sequi ab molestiae non ullam perspiciatis non sequi rem at quam voluptatem consectetur sed beatae sit qui id vero rerum consectetur error ut saepe omnis ratione velit recusandae sequi aut consequuntur veritatis omnis veniam totam sint quibusdam ut tempore maxime hic pariatur voluptas sit facere omnis error eligendi blanditiis rerum debitis id quo minus ex sed ut repudiandae praesentium aut molestias cupiditate quam error saepe sunt sit eum dolores tempore optio totam culpa et magnam soluta omnis ipsam ipsum enim possimus ut nihil eos facilis eveniet necessitatibus exercitationem velit vero ipsam ut magni eligendi debitis voluptas ve