INSERT INTO `course_news` VALUES ('677', '10', 'Ut quis voluptatem saepe voluptatibus.', 'Ut inventore laudantium culpa facere et odio at aut dolore soluta vitae beatae harum excepturi numquam ex magni voluptates ut similique hic dolorem ipsa et aspernatur distinctio tempora est et porro laboriosam dolorem ut architecto excepturi deserunt veniam ut quos qui repellendus illo iure unde dolorem est amet quos consequatur dolor voluptas animi amet nihil itaque laboriosam sit ea similique voluptatibus commodi et animi dolorem atque quidem sit quidem quibusdam velit fugit rerum voluptatem aut alias repudiandae consequatur iste doloribus facilis facilis numquam ad quo enim eos non earum voluptatibus itaque earum incidunt consequuntur et ut dicta rerum mollitia enim nulla officia veniam quis ad animi animi nesciunt deserunt nihil ex quia quasi ducimus dolorum accusantium officiis qui qui est sit aspernatur maiores hic odit ipsa quas sed impedit quae est et quibusdam non id consequatur et quos quia eum iste facere temporibus unde dignissimos deleniti temporibus tenetur quibusdam qui fugiat aut sit omnis sed quidem excepturi veniam eligendi aut et voluptatum veniam cumque quia exercitationem qui similique aut voluptatibus adipisci expedita blanditiis in a aspernatur quo aut optio quis unde sint et quo molestiae repudiandae eligendi et ea voluptatem molestiae ut praesentium voluptatem porro non animi tempore amet fuga sit sed consequatur voluptatum a quidem odio corporis qui fugiat debitis inventore veniam accusamus fugit repellat et voluptas dolorem voluptatem a assumenda ullam id cupiditate et quis explicabo quia soluta exercitationem enim quidem hic nesciunt totam in cumque amet explicabo ipsa laborum praesentium omnis nihil iste nobis soluta eligendi qui autem aperiam quidem soluta et veritatis magnam voluptate rerum quae quo repellat fugiat quis nostrum voluptas odio accusamus aut illo saepe vel eum est velit quisquam adipisci ducimus deleniti animi maiores nesciunt eum re