INSERT INTO `course_news` VALUES ('678', '5', 'Vel excepturi voluptatem consequatur.', 'Eos est debitis repudiandae occaecati odit quia eum sint animi magnam rem quam necessitatibus voluptate et ratione molestiae id vitae sed et magni ea est odit labore et fugiat enim eos quasi nobis repudiandae voluptates est aut non voluptatum quisquam praesentium doloribus velit nostrum numquam molestias nisi dolorem doloribus voluptas optio vel perspiciatis ut quas reiciendis recusandae qui hic quo molestiae nihil molestiae praesentium quis corrupti et natus vel porro voluptatibus consequuntur laudantium tempora repellat consectetur eos consequatur et quasi et rerum dolore autem velit quae neque voluptas id doloremque molestiae laboriosam facilis ut molestias omnis et quis nobis blanditiis ducimus eos enim rerum minus excepturi soluta accusantium necessitatibus velit et possimus illo nulla sunt architecto fuga et accusamus sint nobis iure beatae odit ea voluptates delectus eaque accusamus voluptatem velit vero odit earum enim qui quod quia molestiae est perferendis porro et animi consequatur voluptas voluptate qui iste hic voluptatibus voluptatem cum dolorem quo unde nulla pariatur ducimus magni qui blanditiis quaerat sequi odit et voluptatibus aut voluptatem et quia ut fugit recusandae similique dolore iste eaque inventore tempore explicabo neque repudiandae consequatur totam accusantium eius cumque accusamus blanditiis velit vitae eos alias quis quod a in aut repellat iusto molestiae voluptatem suscipit cum repudiandae officiis eos distinctio qui consectetur inventore cum ea impedit explicabo sit saepe tempora tenetur voluptatem molestias qui nam rerum repudiandae placeat qui impedit excepturi quo nostrum impedit ut aut.', '1', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
