llum facere aspernatur tempore doloribus rerum omnis et assumenda expedita dolorum assumenda quod id qui ut voluptatem neque est ea voluptas perspiciatis et ut et eius est consequatur omnis illo voluptatum molestiae quasi nobis nam et laborum et et deleniti dolores cupiditate veniam eaque enim dolorem beatae omnis laborum voluptas laboriosam mollitia dignissimos quod quae ut veniam est quas esse nostrum fuga tempore occaecati dolorem non incidunt aut et ut earum officiis quasi perferendis accusamus eum sint quia.', '1', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
INSERT INTO `course_news` VALUES ('680', '4', 'Soluta quia quas praesentium adipisci tempora et natus.', 'Officiis laudantium ea et sint provident non dolores omnis et voluptate cumque possimus qui ipsum quia reiciendis at fuga ipsa ea temporibus pariatur vel sed laudantium voluptate beatae velit aperiam possimus facilis dolorum qui sit consequatur quam aut velit quas eum est eos animi deserunt velit porro a autem omnis dolor pariatur quo et est voluptatem qui maiores porro dolorem ut eveniet vel dolores voluptatem atque vitae ea cum consectetur quibusdam quia voluptatem sunt et atque quaerat similique qui culpa cupiditate consequatur eius dolor excepturi laboriosam esse et rem placeat expedita rerum et et placeat consectetur eum tenetur suscipit pariatur velit magnam accusantium cupiditate voluptatibus nostrum neque ullam quod aut temporibus iure at quam quod ad ex rerum sed ab nostrum ullam aut explicabo accusantium voluptas odit commodi in ad iste alias accusamus ut omnis at consequatur aut recusandae iure enim voluptas qui quis ea vero repellat ad nihil molestiae commodi quos sequi et qui doloremque rerum necessitatibus consequatur alias expedita reiciendis dicta dolor consectetur sapiente deleniti libero aut ipsum voluptatem sequi non sit harum rem laudantium sint soluta consequatur ut nulla consequatur minus aut nemo omnis quos voluptatibus quas culpa illum tenetur molestias omnis quod enim et qui quidem officia quidem aut omnis corrupti esse omnis ipsam quia nulla maxime autem sapiente eum cumque voluptatem aut odio eos et temporibus ipsa inventore aut nisi unde aut voluptas omnis sint omnis harum quia ut minus modi non corporis velit iste nesciunt deleniti ratione ab et necessitatibus quo neque maiores est mollitia quia aut a sit consequatur quasi ea quam sunt neque esse sed dolor aliquid eius voluptatem dolorum et a ex quam quo sit et aut totam maxime dolores velit similique omnis rerum possimus adipisci quia rem aperiam tempora aperiam qui non aliquid non qui eius expedita perferendis quas ut cumque ut eligendi aliquam hic fugit nihil repudiandae aspernatur pariatur molestiae est quos omnis a et inventore est quia molestiae sint sunt cum quam voluptatem nam quo sed sed nihil autem nostrum veritatis ut fuga enim repudiandae quisquam soluta odit iste repellendus ut quo voluptatem illo rerum eveniet debitis eos enim incidunt sed voluptatem dolore tempore et est.', '1', '2017-05-02 22:59:24', '2017-05-02 22:59:24');
INSERT INTO `course_news` VALUES ('681', '2', 'Mollitia aspernatur labore dolorem et ratione officiis fuga perspiciatis.', 'Ut nostrum asperiores est illo quam consequatur qui molestias consequatur quo dicta aliquam sint quis tempore officiis aut in commodi perferendis sequi ex illo qui illo ut assumenda tempora itaque temporibus eos qui inventore esse illo ipsam exercitationem incidunt atque assumenda atque rerum expedita saepe velit quam omnis quae quo eveniet aspernatur quae nobis in sapiente laborum ad non possimus facilis saepe aspernatur odit consequatur laboriosam inventore porro ipsa eum architecto est quidem praesentium provident et rerum doloribus sit asperiores temporibus et sit officia tempora ipsam quia asperiores temporibus accusamus quia dolor in tempora fuga eveniet repellat non voluptatibus aut omnis nam quo delectus omnis qui ab voluptatem velit voluptas dicta voluptates explicabo asperiores voluptate animi natus ut atque voluptas qui autem molestiae sapiente culpa accusamus nemo vel harum aut sequi cumque qui et magnam assumenda repudiandae dignissimos temporibus quidem sequi nulla similique ut quia ut eum sit amet quis voluptas quia explicabo eius dicta voluptatum qui est sunt laboriosam sequi cum qui molestiae in facilis consequatur adipisci error reiciendis id explicabo non nisi aspernatur beatae in qui reprehenderit dolorem veritatis exercitationem voluptatem ea maxime est voluptatibus esse temporibus molestias magnam fuga error aut autem sint corrupti nobis consequatur qui dolores aut ut eum officiis velit esse rerum aut inventore ea modi aut qui quia velit mollitia sunt necessitatibus temporibus consequatur eligendi doloremque est quis qui aliquam ipsa et cupiditate aspernatur aut repellendus reprehenderit illum ut autem eligendi ut nisi eos consectetur expedita laboriosam nihil maxime sequi id occaecati dolores a eveniet eos magni sit blanditiis et animi assumenda temporibus veritatis ratione sed voluptate accusamus voluptate distinctio exp