INSERT INTO `course_news` VALUES ('682', '9', 'Sit ut tempore deserunt voluptatem earum sed eaque.', 'Enim unde veniam placeat ex voluptas laboriosam odit sit tempora quidem corrupti minima illo consequatur dolore alias mollitia ducimus temporibus labore possimus libero deleniti quia laudantium neque voluptas ab et non natus incidunt repellat voluptatem sed occaecati consequatur aut odio est similique alias magnam cum optio ut rerum dolor id veritatis voluptate numquam modi laborum sunt et voluptatem est nesciunt aut harum itaque laudantium quas fugit quod sequi labore porro quia quisquam dicta error beatae iusto voluptatem eos ullam laboriosam est consequatur nihil blanditiis vero ut natus esse non quia rem sunt et recusandae iure omnis itaque autem nesciunt voluptatem in ducimus ea animi corporis nemo maiores consectetur necessitatibus sed unde quis molestiae ut praesentium voluptatem sit quaerat ad atque corporis fuga velit cum nostrum esse eos dolorem qui rerum veniam temporibus fuga distinctio vel commodi qui cumque dolorum quam in qui magni rerum itaque dolore distinctio excepturi ipsum sunt suscipit sed nihil expedita eaque rem autem minus consequatur nisi similique nam sapiente illum asperiores doloribus itaque dolores qui eos qui ipsam placeat vel vel quam ut fugiat error rerum consequatur voluptatem et iste facilis facere blanditiis sunt repellendus temporibus cupiditate exercitationem voluptatum vel ipsa eveniet facere quisquam consectetur provident consequuntur cumque expedita voluptatem dolor voluptatem id eaque nesciunt quasi ducimus qui ut quis quos magnam ea sit velit sed vitae mollitia quos omnis sunt reiciendis nihil est voluptas delectus nihil qui ut facilis possimus dolores debitis in et repudiandae incidunt earum fuga dolor deserunt impedit possimus laudantium sit necessitatibus occaecati cum commodi saepe dignissimos fugit cupiditate reiciendis non aut hic provident dolores ab maxime dolor eius harum.', '1', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('683', '5', 'Ratione est a vel.', 'Quo soluta veniam rem facere pariatur neque optio sunt odio qui omnis autem corrupti aliquam doloribus et excepturi aut aliquam aliquid reiciendis neque et voluptatibus nam qui voluptatem assumenda sit est totam voluptatem repellendus aspernatur ipsam et consequatur velit ea ipsum earum iste ea dignissimos ab debitis quis quis sunt reprehenderit autem quis temporibus autem unde ut dolore doloremque libero consequatur sint sint enim ut nulla voluptas voluptatem quia placeat et quasi maiores soluta tempora sint rerum vel aut architecto autem distinctio expedita quas id nulla eaque officiis vitae voluptas debitis aut autem culpa distinctio repellendus explicabo fugit cum voluptate vitae suscipit assumenda ullam voluptates magnam voluptatem nulla ipsam quia voluptatum ex laborum enim nisi magnam veniam et laudantium inventore quibusdam odio in quam eligendi omnis sed laborum quibusdam eum officia ut quos non ducimus explicabo expedita eum doloribus suscipit qui in voluptatem exercitationem numquam illum eos doloribus consequatur nemo quasi reiciendis saepe earum velit sit exercitationem qui nihil provident est culpa provident laudantium deserunt fugiat molestiae eum commodi voluptatem veniam quas ut doloribus voluptas nihil ipsam ad voluptatibus eos saepe aut suscipit corrupti doloremque dicta quod ut et sed perferendis aut repellendus quia ea nisi sit aspernatur assumenda voluptatem laudantium placeat quis eum distinctio quidem iure a inventore porro hic et et cum totam et aut et et necessitatibus odit illum natus sed quis voluptatibus ullam eveniet et sed consectetur dolore ipsam autem non qui repellat sed suscipit voluptatem eveniet consequatur laudantium voluptatibus cum at voluptate molestias perspiciatis ratione repudiandae expedita a odit harum dignissimos occaecati voluptatem quia nostrum ipsam in neque accusamus sed ut neque est est culpa quis quia necessitatibus asperiores dicta est blanditiis praesentium esse cupiditate quo qui sed corrupti nobis qui excepturi cupiditate voluptas ducimus et iure corrupti quisquam illum eos perspiciatis culpa aut maiores aut et aut fugit culpa enim rerum et laboriosam aut molestiae nobis et voluptatem facere rerum aut consequatur blanditiis unde eos nihil ut rerum nihil et enim unde tenetur dolorem fugiat sit sint temporibus magni optio ut sunt illo eos dolorum consequuntur sed totam animi qui sint similique nesciunt harum veritatis deleniti voluptatibus ratione aut saepe aut dolor sed qui facilis quia qui hic ipsa harum dolore odio saepe rerum sequi earum consectetur voluptatem molestiae ut quos quia dolorum sed et a voluptatum tempore minus.', '1', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('684', '10', 'Beatae commodi facilis fugiat molestias explicabo consequatur quidem.', 'Eius magnam eum harum placeat nihil eveniet sed alias eos reprehenderit consequatur est eaque et non qui eos quisquam temporibus id ab amet iste saepe voluptas illo mollitia natus vero delectus blanditiis dolorem sit tenetur in voluptatibus alias voluptatem magni voluptatem ea nihil similique excepturi nam ut non consequatur dolor minus consequatur consequatur qui dolorem in qui sit facere voluptas ducimus nihil ipsa atque omnis unde voluptatem cupiditate quia aperiam perferendis doloremque commodi voluptates enim pariatur perferendis qui ut consectetur nobis consequatur doloribus deserunt magnam sint qui mollitia eligendi aut quam recusandae magni qui cumque ut non occaecati praesentium dicta totam maiores vero accusantium magnam a possimus optio natus sed fugit aperiam doloremque et blanditiis placeat quia aperiam fugiat explicabo autem itaque possimus est aut rem sit assumenda quas incidunt tempore molestiae beatae suscipit nobis et dolor quas officiis et consequatur sit excepturi voluptatem repellendus possimus quas et placeat in cumque cumque dolor officiis ipsa perspiciatis sint perferendis ab commodi architecto sit aut ab impedit beatae labore aperiam unde eius rerum pariatur accusantium dolorem ratione enim porro iure omnis harum repudiandae dolorem nihil doloribus quo nulla perferendis debitis nisi illum quia dolores dolore expedita eius et sit ullam quo sed eum dolor incidunt voluptatem exercitationem laudantium suscipit laborum accusamus velit commodi dignissimos praesentium et ab delectus et dolorem voluptate soluta nihil laborum voluptatibus culpa porro voluptatem dolorem voluptate temporibus eaque sit sunt omnis autem minus amet velit et velit voluptatem iure atque in consequatur voluptatem repellat itaque tempora ratione nemo est recusandae nihil asperiores sed occaecati ad reprehenderit quis eveniet mollitia et modi deleniti temporibus assumenda reiciendis eius maiores quibusdam porro dolorem rem repellendus eligendi omnis tempore doloribus voluptas excepturi possimus nobis suscipit quia accusantium qui numquam iste dolor beatae est autem harum dolorem sint et inventore quis omnis vero maxime placeat voluptatem iusto ducimus aliquid dolores dolorem animi ipsam tempore culpa eum nihil consequuntur quod assumenda ea velit in quaerat illum officiis sit velit placeat odio non incidunt ut nobis quod qui cumque nihil eum optio et sint doloribus omnis alias magnam eaque nesciunt repellendus non et praesentium nihil iure velit itaque in maiores et perferendis sunt et eos molestias quia voluptatem amet dolorum fugit iure illum tenetur est doloribus sed non quia numquam perferendis et tempora accusamus debitis odit et quia sint nemo et sit aut voluptatem vero nostrum.', '0', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('685', '2', 'Sed at qui perferendis sint corporis.', 'Aspernatur quia vero soluta vitae ab minima praesentium ut voluptates corporis omnis officiis totam labore commodi et vel natus consequatur nostrum officiis consequatur ad labore delectus illo omnis velit assumenda esse in optio qui natus harum et aut est aperiam provident est molestiae velit ut harum molestiae quo quae neque unde dolor praesentium consequatur molestiae quo et quisquam aut illo necessitatibus voluptatem vel placeat deleniti aliquam iure accusamus sit quidem et magni officiis sapiente nihil voluptas blanditiis est et vero quia inventore ea veniam reiciendis alias dolor cupiditate ea nostrum saepe quam suscipit sequi aliquid consequatur molestiae rerum dolorem sunt unde ut provident vitae quibusdam quo distinctio repellat nihil vero enim ea blanditiis culpa distinctio est dolor accusamus molestiae aut dolores velit quia repellat eaque pariatur recusandae excepturi eum distinctio repudiandae minus numquam enim sit architecto quo laudantium est blanditiis eum rem voluptates rem sint qui eum officiis nobis modi molestiae hic blanditiis quasi aut omnis esse qui veritatis aut quo quasi qui repellendus enim blanditiis quos ut distinctio at cumque omnis deleniti hic quisquam id ex quis fugit voluptatem voluptas nam impedit nihil eaque ea modi quod cumque reiciendis mollitia maxime cum aut blanditiis culpa porro doloremque recusandae animi nobis autem vel odit dignissimos.', '0', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('686', '3', 'Nobis magni perferendis ut aliquam quod explicabo.', 'Aliquam quia id est nam et sunt excepturi voluptatem beatae sapiente enim nam in voluptatum cupiditate alias ut et rerum qui commodi doloremque est ullam nihil non reprehenderit aut alias rem nihil animi iure qui distinctio ducimus nesciunt nesciunt illum sit voluptas labore et inventore voluptatem commodi quo et et alias a consequatur quia doloremque nulla aliquid eaque aut sint minus ab ipsam aliquid odio autem sunt et consequuntur omnis earum voluptatem accusamus veniam rem necessitatibus sit voluptate enim nam atque labore beatae velit est non nobis non sit velit vel quo et libero vel distinctio magni minus voluptatem molestias eos porro nostrum alias est eaque eum et id et quas mollitia at fugit qui voluptates aut aut iure necessitatibus culpa odit facere impedit sed omnis maiores dolore tenetur unde ducimus in sit et similique quia laborum aspernatur est id doloribus natus aliquid dolores consequatur totam consequatur qui enim et ducimus laborum quidem voluptatum et est distinctio ut praesentium repudiandae optio unde et id veniam itaque qui voluptate fugit eligendi nam sit vitae asperiores adipisci quia laudantium nihil voluptas neque in voluptate eaque possimus ut voluptatem et neque sequi repudiandae reprehenderit optio quis et et illo voluptatem occaecati et deserunt aut ratione quibusdam est sint dolorum consequatur eum doloribus quisquam iste vitae nihil optio omnis expedita rerum maxime quis sit a nisi et est eveniet repellat natus a ipsam adipisci quisquam officiis repellendus ad nobis eius et dolor amet voluptatum fugit sunt ea sequi est ut nulla consectetur officia sequi laboriosam eos et incidunt consequuntur dicta maiores aut omnis voluptatibus illum nesciunt velit sit mollitia quam omnis repellat sit laboriosam distinctio quibusdam natus perspiciatis nam sequi velit aut veniam molestias quasi qui sequi vel ex a quia assumenda consequuntur quia ut odio ut facere rerum doloremque tempore iure quod consectetur quia quia ipsum officiis officia voluptates expedita ipsum fugit omnis vel beatae maiores quos voluptate tenetur at excepturi dolorum doloribus possimus voluptatem iusto laborum illo vero aliquam quisquam provident veritatis deleniti aspernatur molestiae accusamus ex est dolor aut voluptas qui voluptas et minus deleniti aut et et culpa fugiat nihil modi esse natus accusantium omnis eum nobis aut atque autem necessitatibus veniam aut itaque labore accusantium aut omnis corrupti omnis veritatis quaerat assumenda quos nihil at eum dolore sed corrupti quae voluptate et earum perspiciatis perspiciatis distinctio qui error dolores ducimus praesentium aut harum odit est suscipit sit neque inventore ullam maiores voluptatem.', '1', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('687', '3', 'Numquam ducimus odit placeat inventore natus.', 'Non in debitis tempore itaque quis repellendus sunt quia rerum expedita vel soluta explicabo nisi odit nobis rerum molestiae cupiditate beatae maiores et vel ducimus labore modi molestiae ut et hic et ut fugit perspiciatis vel accusantium alias quis consequatur sint mollitia dignissimos tempore recusandae odit voluptatibus incidunt quos est soluta magni nisi ratione aspernatur quo in non amet molestias eum quae reprehenderit quae autem aperiam quis harum fugiat reprehenderit aspernatur qui inventore quia et fugit et sapiente enim quod ipsam beatae nesciunt facilis repellendus dolores qui praesentium nostrum placeat laboriosam nostrum aliquam consequatur sequi in voluptate ut qui et sit quam voluptas natus voluptatem ut enim soluta provident ea est aliquid sed quos quod porro enim impedit dolor ex iure debitis perferendis laudantium enim molestiae aliquid eum ipsam non numquam quasi corrupti impedit optio ipsam fuga et eligendi quia iure adipisci voluptates nulla cum iusto qui quas sed consequuntur blanditiis repellat sapiente aut molestiae voluptates magni cumque aut deleniti ullam ullam magnam quia facere optio fugiat necessitatibus et vero omnis ab animi corporis sapiente illum voluptates excepturi et laudantium quia non qui aut dolor quaerat est enim eos neque sed dolores odio error saepe est soluta quisquam a eveniet sint error qui omnis doloribus repudiandae fugit ratione dolorum enim id pariatur odit quam sed fugit consequatur sed itaque nihil unde explicabo minima et reiciendis fuga omnis et non repellendus voluptate inventore doloribus maiores est tempore et veritatis qui sit atque modi soluta alias consequatur quis voluptatibus omnis fugit pariatur repellat quos sunt est laboriosam facere amet quisquam ut natus dolorem consequatur corrupti sed quia qui earum iusto dicta nam quia aut non sapiente dolorum deleniti et sint provident deserunt voluptas sit in perspiciatis natus id voluptates consequatur blanditiis voluptates omnis sint laborum porro deleniti dolorem voluptas necessitatibus ea ad corporis est qui corrupti voluptas tempore suscipit accusantium inventore id tempore ut et dolorum et aut omnis sit velit tempora et error.', '1', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('688', '8', 'Unde quae est eum quod consequatur.', 'Culpa omnis et nam consequuntur molestiae eum perspiciatis ad magnam aut repudiandae ut animi facilis voluptas sed sunt libero necessitatibus ipsam sunt ducimus optio nemo enim repellat vitae minus magnam eligendi accusantium eos excepturi expedita minima aut voluptates saepe aut et officiis quibusdam autem nulla eos quas quo impedit aut quam facere autem dolor tenetur alias et velit ut dolor quos sint laboriosam maxime minus qui ut numquam sit aut tempora dolores distinctio dolorem ut fuga consequatur rerum vel aperiam adipisci officiis qui placeat et suscipit ipsa nesciunt at quasi animi asperiores temporibus illum consequatur repellendus est aut repudiandae deserunt dolor consequuntur sequi pariatur ut sequi sunt ut deserunt sapiente omnis aperiam autem corporis quia molestiae et doloremque placeat voluptas dignissimos similique quia et pariatur molestiae illo qui ad voluptatem voluptas voluptatibus nihil omnis aut nulla quia totam eum minima qui illum asperiores alias esse quam fugiat fugiat optio cum aut doloremque soluta ab sit in ea atque quo laudantium eum dolorum itaque delectus sed quia odio a labore cum architecto minima provident accusamus delectus sapiente vel assumenda qui qui ullam.', '0', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('689', '3', 'Laudantium facere sunt debitis illum voluptatum iure excepturi.', 'Perferendis repellat sit sapiente molestias officia est sit modi sunt amet odit aut repellendus vitae et quaerat officia et dignissimos voluptas et aut qui quis quia aut voluptates ab et autem vel dolorum molestiae ea illo nam neque omnis ut vel iusto eligendi eaque fuga voluptates earum amet rerum illum rerum neque sapiente eligendi tenetur explicabo sint aliquam qui iure voluptates non voluptas aut quam molestiae dignissimos rerum cumque atque quibusdam eos omnis minus veniam maxime nisi consequatur eum dolor odit nisi ullam sit enim exercitationem mollitia hic delectus sequi tenetur quia et aliquid quas beatae omnis accusamus est vero sunt et maxime esse qui sapiente eveniet laborum qui recusandae voluptates et saepe debitis necessitatibus eum est quod quae dignissimos ullam consequatur incidunt explicabo maxime eum voluptatem quia nihil minus qui provident libero perferendis non sunt ut et et suscipit iusto facilis itaque accusantium sequi nulla illum quis excepturi aut omnis temporibus consequuntur omnis architecto in distinctio non quo quos molestiae ut repudiandae et sapiente sunt optio sapiente veniam ipsa sed modi voluptatem adipisci exercitationem quo occaecati quaerat quisquam molestiae hic perspiciatis dolore dolores quasi repudiandae ut modi temporibus eum debitis exercitationem placeat perferendis consequatur quisquam mollitia rerum vitae laudantium voluptate voluptatem non aut velit maxime cum delectus nulla molestiae voluptas dolore delectus blanditiis quia aut dicta atque autem aut at ut quo non nemo unde quo quia quaerat dolorum quo officia sit quo optio aperiam omnis reprehenderit quibusdam soluta cupiditate ut ut magni ad placeat et dolorum autem dolores debitis ullam consequatur incidunt optio quaerat iure fugit perspiciatis neque minus reprehenderit inventore ducimus occaecati assumenda repellat minima aliquam iure dicta suscipit optio dolorem aut et temporibus et asperiores minima quis saepe ducimus laborum voluptatem reprehenderit repellendus id ex.', '1', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('690', '7', 'Quaerat dolorem nemo sunt hic doloremque.', 'Et error tempora sint libero non eum maxime excepturi aliquid explicabo est fuga eius illo eaque quis est aperiam deleniti optio sunt quasi nesciunt quod atque impedit perferendis quia temporibus vitae pariatur aspernatur iusto officia suscipit id ut provident et ad sed reiciendis non non molestias cumque rerum minima ullam cum laudantium sint est hic ut ipsum labore qui eos totam ut et laboriosam repellendus doloribus quaerat id et excepturi eos similique libero ut cupiditate praesentium sed magnam molestiae eius dolorem omnis et omnis voluptates voluptas ullam nihil ut ullam est sequi distinctio corrupti ut animi voluptatem neque aut voluptatibus quia porro labore nesciunt non qui est odit sed omnis dolorem eaque asperiores magni at ex veniam similique et aut sint cupiditate dolorum unde cupiditate et ratione non molestiae dicta vitae omnis voluptas et deserunt accusamus hic nostrum nobis officiis laborum in laborum nobis sed totam quia non officiis doloribus sint ut quae voluptate maxime dolore in dolorem ducimus quisquam harum voluptatum laudantium soluta consequatur sequi quia laudantium voluptatem cumque voluptatum praesentium ipsam odio praesentium corrupti mollitia dolor recusandae sequi quaerat pariatur quo quo aut praesentium ratione aliquam mollitia dolores explicabo eos nobis aliquid totam eum accusantium eum omnis sequi voluptatem at dolor id enim quam ut nisi aperiam magnam a tempore dolorum explicabo id numquam in necessitatibus nihil blanditiis fuga neque temporibus iste non quidem suscipit officia dolorem ut et vero vero aut a est mollitia id qui dolores ab quibusdam dolor adipisci eum error facere quisquam ab voluptas eum molestiae voluptatem ea modi suscipit ad commodi aspernatur eos voluptatibus fuga voluptates totam corporis excepturi consectetur voluptatem qui ad voluptas maxime nihil soluta porro animi consequatur dolorum voluptate vel eaque quo ducimus