INSERT INTO `course_news` VALUES ('691', '4', 'Nostrum molestiae a nisi voluptas et.', 'Occaecati iusto ducimus eaque pariatur est quisquam et repudiandae hic atque quos assumenda ab magnam qui quibusdam sit amet fuga sint sit sint nam et veritatis enim quae molestias amet et quibusdam eveniet inventore incidunt libero voluptatum laudantium repellendus aspernatur molestiae itaque magni aliquam possimus deserunt sapiente ipsam et voluptas est veritatis eum sed aperiam sed rerum et tenetur in assumenda sunt consequuntur saepe dolore recusandae enim velit exercitationem explicabo est fuga possimus inventore ut exercitationem eligendi quis deleniti inventore molestiae rem amet iste sed quidem veniam aut et repudiandae non alias suscipit porro voluptas repellendus esse voluptatem neque voluptatem officia voluptates nisi asperiores explicabo accusantium qui ex nemo voluptatem optio qui placeat magni id quam quia debitis distinctio doloribus et qui praesentium dolorum suscipit qui enim expedita et enim facere sint est ullam omnis sed ut quaerat qui aut qui molestias a at veniam atque dignissimos consectetur veritatis non praesentium non omnis sit amet eaque dolores assumenda aut accusantium eaque nesciunt et ipsa architecto expedita laborum consequatur necessitatibus aut et excepturi eaque aut voluptatem harum suscipit voluptatem veritatis autem corrupti et consequatur ut eos laudantium ut vitae natus sunt inventore incidunt sequi doloremque quibusdam ut illo eum accusantium quia incidunt eaque quia sit quo.', '0', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('692', '6', 'Qui sint voluptas sequi illum ut consectetur sapiente.', 'Omnis temporibus quia veritatis quos sequi est praesentium illo nam sint reprehenderit natus inventore sapiente ab maiores qui quia qui aut blanditiis est quas quo eum id quaerat amet voluptas et suscipit dolore expedita facere sint sit qui deserunt sapiente magni illum vitae dolor aspernatur harum autem nostrum est molestiae fuga inventore omnis quos eum fugiat commodi nihil rem mollitia harum iusto vitae quo quia iusto quos eos consequatur harum eum minus assumenda ipsa nostrum et veniam tempore optio dolor voluptatem dicta qui doloremque quas inventore est rerum voluptatum necessitatibus mollitia porro ullam vel aspernatur minus quam dignissimos voluptates odit enim laborum et dolore ex ipsa qui sequi reprehenderit quas eos ad eum fugiat porro qui blanditiis nostrum sit voluptatem ut cupiditate alias dolorem magnam voluptate ad molestiae et delectus aut ipsa quibusdam explicabo fugiat unde qui ducimus aut cumque tenetur dolorem temporibus nulla explicabo molestiae corporis impedit maiores beatae omnis nemo non saepe odit explicabo natus rerum asperiores et inventore voluptates laborum consequatur assumenda aut unde expedita fugit quia et ut perferendis quae quae quod itaque eum veniam accusantium officiis quis sit nihil et adipisci rerum sunt commodi iste tempore ut exercitationem cumque voluptas ea et fuga ut cum minima itaque tenetur adipisci neque illum dolores ab quae consectetur qui laudantium qui est enim ut possimus sapiente quisquam omnis accusantium sint labore omnis placeat quae harum a non deserunt incidunt suscipit odio non modi non accusantium voluptatem esse enim ut et sed inventore cupiditate possimus non harum quo velit quas voluptas quae sed consequuntur beatae nesciunt rem explicabo blanditiis est expedita placeat error iste reprehenderit velit ducimus voluptates reiciendis ut velit ut qui voluptatem est qui perferendis aliquid ut odio quaera