INSERT INTO `course_news` VALUES ('693', '7', 'Soluta est tempore dignissimos.', 'Vel non cupiditate qui sed voluptatem voluptatem animi quidem ut maiores distinctio voluptatem sapiente omnis dignissimos eos modi molestiae dolore sapiente et iusto magnam dicta et dolorem odio ipsa et inventore dolores quas atque laudantium eius quod minima impedit minus architecto et tempora voluptatem eum nobis vel sunt veritatis alias vel culpa ut sunt sit sunt voluptates dignissimos repellendus nesciunt facilis corporis animi enim illum exercitationem rerum quis expedita in quod et aut enim odio quisquam consequuntur in natus assumenda illo culpa qui eum atque aspernatur sunt sed sed eius neque aut est praesentium voluptas fugit ab eum et autem minus explicabo quia vel asperiores perspiciatis consequuntur quo incidunt aliquid aperiam totam et molestiae et quia doloremque dolor non et ab nihil ut fugit aperiam provident reiciendis veritatis non sunt reprehenderit ut minus eveniet ipsam possimus architecto corrupti corrupti qui doloremque aliquid repudiandae praesentium maxime aut sequi qui aut ex voluptatem autem optio omnis ex rerum animi provident vero et voluptates sit quia id in ratione quo eos inventore aliquid at minus molestiae ut et et ipsum officiis ea sit impedit quae qui ad temporibus voluptatem doloribus aut id omnis molestias est aut pariatur et ipsam deserunt occaecati ex eligendi et et ut voluptatum aut magni quo quaerat tenetur alias mollitia id et aut aut optio debitis voluptatem accusamus voluptatem quo assumenda hic tempore aperiam praesentium dicta aut corrupti repudiandae assumenda est qui nostrum asperiores.', '0', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('694', '3', 'Debitis neque rerum delectus facere.', 'Porro occaecati deleniti assumenda quos architecto veritatis repellendus occaecati amet provident itaque est facere dolores aut necessitatibus error saepe vero totam nostrum ut et cupiditate cum fugit numquam nobis sint est quas incidunt unde quod voluptas et aut a qui est ratione veniam animi consequuntur ducimus rerum rerum aut optio et deleniti dolores minus error tempore deserunt qui sint mollitia quae natus dicta odit amet et aut quia labore rerum alias qui dolorem temporibus corporis ipsam nemo ut saepe ut deleniti et aperiam nihil commodi ullam ut et impedit vel alias quae eum magnam autem nam ut vel earum qui ullam ea nesciunt quisquam quibusdam consequuntur iste numquam quas soluta et fugiat et fugiat aspernatur mollitia et non quia aut praesentium adipisci quod omnis non dolore ratione vitae asperiores accusantium non ab in deleniti libero aut consectetur facere dolor reiciendis est sunt harum aperiam impedit vel minima mollitia facilis quia necessitatibus distinctio ducimus harum sit libero aliquam rerum nostrum sed et veniam at quae adipisci soluta ex in similique vel in distinctio amet veniam aperiam aut qui quos veritatis repudiandae nesciunt laudantium provident praesentium doloremque perspiciatis nisi rem ut voluptas quia earum vitae dolor debitis nihil aut id aspernatur culpa harum corporis enim saepe deleniti magni corporis qui omnis repellendus nesciunt neque ipsam vel consequuntur eum fugiat minima quo inventore occaecati adipisci et sapiente qui incidunt et enim quis ut rem autem recusandae in accusamus magni fugit voluptatem omnis aut id.', '1', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('695', '8', 'Hic saepe doloribus porro iste.', 'Optio debitis autem esse dicta itaque sed omnis quas dolore velit sint ea saepe magnam unde consequatur molestiae quis mollitia rerum necessitatibus architecto voluptatem et distinctio iure doloribus enim inventore in dolorem quidem autem magnam ea alias hic natus nesciunt sit repellat molestiae quam dolorem nam rerum quo ut alias neque molestiae qui ut labore ex id et accusamus praesentium iste veniam temporibus et quia molestiae rerum praesentium modi dolore non adipisci consequatur ut ea amet omnis exercitationem ratione debitis laudantium unde molestias assumenda quo consequatur perferendis numquam doloribus voluptatem aut quibusdam sit nam corporis at aut voluptas non dolor alias saepe et adipisci possimus quos deleniti repudiandae ducimus sint delectus error deleniti molestiae enim quod eum nesciunt earum occaecati optio nemo culpa provident possimus explicabo autem explicabo dolorum voluptas laboriosam ad dolore sint ipsa repellat nobis ex dolor et vero sed non quam iste qui officiis est tenetur sed qui recusandae et maiores quisquam sequi dolorum voluptatum qui quia perferendis ut sed veniam qui eligendi natus doloribus at eius aut accusamus dolore a minima maxime et officiis facilis dolorem nihil eveniet adipisci sunt fuga quia aperiam sit veritatis porro esse sunt et libero quasi aut ipsum eum et possimus et in esse mollitia repellendus voluptas omnis sed ut esse iusto sit eveniet necessitatibus omnis sunt harum voluptate eveniet quo odio reprehenderit facere aut nulla est soluta error porro nisi dolor repellat voluptatem praesentium saepe occaecati et ex est est magnam reprehenderit minima officia et earum sed doloremque doloribus omnis non omnis sequi quis cupiditate laborum earum rerum aut sunt autem cumque ut animi sit eum voluptatem sapiente eligendi est aliquid et nostrum illo accusamus neque optio tempore beatae totam sapiente fugit omnis culpa officia non dolorum dolo