INSERT INTO `course_news` VALUES ('696', '4', 'Doloremque rerum animi blanditiis quia culpa distinctio aut.', 'Quos voluptatum sit modi tenetur et nisi aut quas nihil aut excepturi odio vel animi autem temporibus provident nihil nisi nemo nam rerum amet ullam est distinctio nobis veniam ea adipisci eum et cumque mollitia est ut est repudiandae aliquid non et aut eos non rerum officia fugit magni nam veniam eligendi consequatur sit quos natus doloribus sunt est dolorem impedit qui ipsam sit mollitia delectus saepe ullam rerum voluptatum debitis omnis ratione voluptatem qui et temporibus autem recusandae doloribus et ad ad et iure ducimus culpa minima veniam maxime perferendis sit dignissimos et voluptatem iure molestiae expedita molestias eligendi ut aspernatur est sed ut sapiente quasi hic soluta delectus consequatur omnis aut aut id ratione suscipit reiciendis nobis quibusdam ut neque perspiciatis qui est veniam dolore voluptas est commodi doloremque eaque rerum praesentium harum commodi a veritatis officia ratione distinctio rerum ducimus cupiditate veritatis amet assumenda autem sint accusamus magni rerum aut aut dolores minima vero eius eos placeat harum nihil ab mollitia sunt temporibus perspiciatis aut voluptatem eum animi atque cum aperiam vitae aut est omnis et ut suscipit eius eveniet ea nihil ut voluptate sed ea esse veniam placeat deleniti placeat molestiae illo deleniti pariatur dolorem suscipit necessitatibus nihil voluptas quae molestiae ratione aut voluptates repellendus beatae velit itaque quia ullam voluptas quia voluptatum molestias hic labore modi pariatur sit rerum tempore et labore quidem aut rerum nulla dolor alias omnis nihil odit et maxime omnis ipsam possimus pariatur non reprehenderit asperiores eum qui et quidem vel sed et assumenda architecto est ea repudiandae dolorem et eos et blanditiis omnis nulla ut magnam eum velit quas assumenda voluptatum dicta quas ut necessitatibus autem laudantium id blanditiis quasi nesciunt reprehenderit elig