INSERT INTO `course_news` VALUES ('697', '2', 'Aut magni id a sed dolore libero odio.', 'Ab nesciunt dolor alias qui est at delectus dignissimos cupiditate sed et eligendi quaerat reiciendis aut et molestiae at consequatur autem quasi facere vero voluptatum ut id veritatis culpa aut sit maiores voluptatem qui blanditiis tenetur magnam inventore ratione assumenda accusantium nihil aut reprehenderit rerum sit officiis vel reiciendis quia labore voluptatem fugit ratione ut nostrum voluptatem atque animi qui veritatis natus laudantium nihil facilis est quia doloremque ut aliquid voluptatem ut et et assumenda repellendus cum dolore nisi ut incidunt possimus repellat laudantium voluptas illum inventore non quod at nobis laudantium ex quae sed corrupti ut eum qui expedita laborum possimus incidunt enim tenetur nihil explicabo optio ut qui molestiae adipisci aliquid suscipit beatae assumenda ipsum fugit ea occaecati voluptas aut maxime ut molestiae placeat consequuntur aut soluta aliquam qui quia explicabo et non quo a omnis corporis illo sint cum aperiam eveniet non ratione quis minima facilis tempore facere doloribus et pariatur ut quis beatae ducimus eos maxime in deleniti quaerat repellendus exercitationem beatae aliquid exercitationem vitae saepe non quod iusto similique odit voluptatem et laudantium et est id pariatur ex cumque iste asperiores enim quia et ut deserunt aut corrupti et vel atque aut aperiam excepturi velit provident voluptatum excepturi ab inventore quis sed enim sint dicta asperiores magnam soluta voluptas eum occaecati libero perspiciatis dolor a officia culpa debitis autem quo odio quaerat ut exercitationem non tempore quia saepe totam repudiandae facilis laborum eius et nobis porro eveniet consequatur a dolores velit earum enim quisquam nihil commodi vel quidem consectetur minus qui sunt commodi assumenda autem esse totam vel voluptatem dolor non earum sint natus vel neque possimus recusandae dolorum ut vero ducimus ea harum voluptatem qui dolorum q