INSERT INTO `course_news` VALUES ('698', '8', 'Delectus at nam ut.', 'Consectetur eveniet eum est consequatur cum veritatis cumque ea molestias similique neque nostrum ducimus rerum quaerat voluptatem animi sit dolorem delectus non ut ex asperiores beatae aspernatur at quasi qui ducimus voluptates blanditiis qui eum nemo voluptatem suscipit quia alias qui earum animi cumque praesentium soluta consequuntur fugiat voluptatibus incidunt aut aut assumenda ratione quibusdam blanditiis laboriosam eos consequatur necessitatibus commodi voluptatem earum rerum distinctio similique exercitationem doloribus similique vero nihil laudantium veritatis dignissimos officia vel a tenetur repudiandae veniam voluptatem maxime ab dolores sequi ratione aspernatur aut vero autem blanditiis autem aspernatur ex in soluta eos harum sit iure quia unde beatae ut mollitia ut excepturi qui rerum voluptatibus est nulla eveniet molestiae aut architecto ea maiores quia occaecati ducimus consequatur porro aspernatur animi explicabo minima inventore dolores quia incidunt molestias et sunt reprehenderit quae iusto illum voluptatem libero et quas perspiciatis ratione occaecati odio quaerat omnis blanditiis et quas esse aliquid velit amet neque aut sit dignissimos reiciendis odio praesentium sunt occaecati qui tenetur corporis harum error et dolor aut ad aut nulla ratione exercitationem ex aut corrupti occaecati voluptatum sed animi aut dolorem quis animi ipsa iure et non delectus nobis voluptas nemo magnam iure animi exercitationem hic vitae et praesentium dolores et sit fuga consequatur et nisi est nulla quasi voluptate facilis iste repudiandae molestias ipsum in saepe rerum ut eum voluptatem eaque illum labore dolorem rem impedit vero vitae quos et necessitatibus aspernatur.', '0', '2017-05-02 22:59:25', '2017-05-02 22:59:25');
INSERT INTO `course_news` VALUES ('699', '7', 'Et ipsam et eaque atque doloremque quo optio ipsum.', 'Illum dolore rerum voluptatibus dolor sequi ut qui fugiat occaecati enim veritatis cum eaque voluptatem ea quaerat facilis pariatur rem possimus nihil tempore nostrum voluptas sed tempora eum a rerum optio consequatur consequuntur aut consequatur deleniti labore et incidunt odit porro ex provident commodi nisi nisi ut aut quia sint vel optio nesciunt exercitationem et et molestias minima at incidunt est rerum sed doloribus eum voluptatibus quo earum ut aut unde nesciunt doloremque ut unde et temporibus ipsa occaecati quidem qui alias doloribus voluptatem quo et delectus voluptatem et saepe necessitatibus consequatur porro architecto itaque natus cum omnis vel ratione quasi cumque dolores est ea autem pariatur sint excepturi quibusdam nulla beatae ut nisi incidunt aut maiores similique ipsam natus architecto hic a nisi sunt sit rerum facere quia magni maxime aut aut nostrum exercitationem ad et similique deleniti aut qui ducimus ea assumenda sed quis ut assumenda illo nemo hic et dignissimos esse placeat omnis enim quis est occaecati laudantium ullam assumenda officia enim dolor dolorem voluptatem eum necessitatibus aut sit mollitia omnis aspernatur magnam error vitae quam vitae qui blanditiis velit praesentium qui rerum vero harum pariatur ab sit quia aspernatur et quia vero sint nihil quod impedit tempora perspiciatis sequi voluptas ut numquam sint qui quo deserunt quidem quaerat accusantium ut eius nesciunt occaecati quod sunt non eius perferendis laudantium inventore similique et modi aut et voluptas sit qui necessitatibus repellat dolorem et dolor et ea reprehenderit ab quia facilis reprehenderit voluptatem minima qui unde dolorem qui dignissimos quo rerum cum quis ea quia aut quia eos enim aut fuga earum aperiam expedita minima libero eveniet doloremque voluptatem aut dolorum recusandae explicabo sint sint blanditiis consequatur totam ut cum et dolor dolores au