INSERT INTO `course_news` VALUES ('700', '2', 'Cum quod aut amet fugiat blanditiis.', 'Mollitia voluptatem sit molestiae quia voluptas aut eum id voluptatem veniam nam distinctio veniam sed quia facere non ut vitae harum nobis saepe est illum autem sint aut sit debitis labore at quo excepturi quia accusamus rerum quos consequatur nam sint aliquam eligendi ex sint excepturi magni perferendis et quo ipsa commodi et officia eligendi doloribus exercitationem ut enim facere alias ut iste quibusdam corporis illo voluptatem totam ut impedit quae fuga est quia sunt numquam enim qui corporis ea atque unde et occaecati ut nihil est repellat qui quam repellendus dolor inventore beatae qui eaque blanditiis facilis earum laborum odio dolores est mollitia dolores veniam quisquam consequuntur magnam velit ipsum architecto hic consectetur vero iure quia et enim deserunt cumque dolor eligendi dicta et et nemo maiores ex illo nostrum saepe accusamus atque ex nihil libero ratione et nemo quisquam expedita voluptates odio perferendis laborum ea enim voluptas eligendi nostrum voluptas unde molestiae qui sunt nobis aut in aut qui debitis reiciendis sint odio quae in impedit qui et earum quod commodi libero inventore inventore quisquam veniam voluptate aut eveniet sunt sit sint magni nisi totam eveniet accusantium atque non eum et non praesentium est nobis est vel numquam delectus labore placeat deserunt a voluptatem fugiat delectus quos asperiores consectetur aut hic repudiandae molestiae eaque quas tempora sapiente nobis quia suscipit dolor explicabo nobis sed corrupti sit magni quo enim consequatur omnis doloribus itaque commodi perspiciatis itaque autem dolorem aut pariatur labore et aliquid praesentium voluptate ex ut doloribus atque enim cumque consequatur rerum alias et error consequatur voluptas debitis aut delectus nisi quis error at exercitationem consectetur et enim illo deleniti doloremque animi dolor ab expedita omnis modi ad ex autem et natus eum nihil et totam natus vero unde qui autem praesentium fuga quas voluptatem et totam eaque unde in voluptate fuga qui fuga quia unde rerum quia voluptas sit ut facere veritatis deserunt necessitatibus corporis libero saepe laboriosam quidem illo quae et totam rerum dolor facilis ipsum quia iure dolor totam ad ut mollitia aspernatur laudantium odit rerum dolores sint qui quia suscipit soluta eos hic aut a.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('701', '4', 'Quo voluptatem unde et magnam sed.', 'Sapiente enim illo voluptatem reprehenderit voluptas eum qui pariatur et quasi eligendi sit voluptatibus consequatur quod ut quis unde veniam aut aliquam natus modi rerum optio reiciendis tempora delectus non fugit ut rerum rerum iure unde sequi in perspiciatis voluptas eius et voluptas occaecati voluptatibus placeat saepe doloribus aliquam dolor rem repudiandae adipisci sed dolor voluptatem ab iure aut expedita dolore nobis et dolore voluptatum dignissimos velit eum sunt ut sit reiciendis nulla nisi possimus enim vel harum omnis maiores qui rerum unde sapiente velit et nisi repudiandae incidunt mollitia magnam qui odit ad soluta velit saepe dolor vel voluptas qui totam ut commodi adipisci illo sit ratione vel quis quas laborum velit in eveniet et repudiandae aut sunt atque eligendi autem labore deleniti ad vel harum omnis deserunt eveniet voluptatem dolorum deleniti a eaque quod exercitationem quo qui ea mollitia doloremque dolorum et aut sunt rem quisquam odit voluptatem perferendis molestiae consequatur veniam earum eligendi voluptatem rerum veniam est repudiandae iusto vitae temporibus fuga voluptas optio numquam quo est omnis et dolorum tempora et vitae autem et consequatur vitae expedita excepturi neque et inventore qui magni placeat et doloremque occaecati repellat qui sint repellendus aut dolorem et cum deserunt est dolor vero sapiente itaque debitis cum omnis.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('702', '6', 'Aut qui et sit animi dicta tenetur qui.', 'Placeat sit sit velit cum unde earum fuga sed fugit reiciendis dolor quos unde repudiandae velit voluptas ut aliquam numquam eligendi ducimus et nemo atque occaecati ullam debitis ipsa aliquam esse aut eum optio et quod officia facere quam consequuntur corporis rem quia quia omnis quidem eligendi facere odio consequatur voluptas quia deleniti quidem eum dolor corrupti amet doloribus facilis enim minus sunt quia quod quia neque ex aut dolor consequatur nam qui eligendi nisi rem qui quas occaecati eligendi unde nisi optio sit aperiam ab dolores qui soluta labore doloribus cumque eveniet quidem voluptas sequi dolorem incidunt voluptas reiciendis dolorem est numquam quia ipsum facere tempore dolores rerum atque labore aut pariatur rerum dolorum molestias natus velit accusantium facilis aut praesentium et atque facilis aliquid voluptas voluptas adipisci dolor illum et ea accusantium qui commodi veritatis fugit natus sit et quae unde natus qui quia sed aliquam mollitia accusantium voluptas error in quisquam quae voluptatem exercitationem aspernatur pariatur voluptatem magni voluptas fuga amet reiciendis ex recusandae et id eligendi et deserunt impedit provident consequatur est et officia quos sed velit ut sed occaecati ut animi accusantium quo molestiae dolore blanditiis iusto vel ut deserunt iste voluptate mollitia nobis unde ratione sapiente maiores officia odio itaque aut excepturi libero earum eos exercitationem minima fuga distinctio ducimus id non magni blanditiis consequatur iusto nihil labore tempora soluta vel exercitationem sit eum natus sint doloremque quidem distinctio cum optio eos animi id dolor et nemo quos nihil dolores fugiat ex accusantium explicabo cumque doloribus accusamus.', '0', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('703', '7', 'Possimus qui labore est optio.', 'Voluptatem error aut quasi assumenda sed adipisci in velit at facere voluptatem repellat in eveniet quis dolore cum enim consequatur necessitatibus assumenda atque aut veniam asperiores quam et vel dolorum nostrum laudantium qui non totam sed occaecati nesciunt quod suscipit est laborum quia unde et officiis perferendis voluptas nihil dolore in rerum illo rerum nihil rerum quidem velit eos omnis qui sit facere atque sit sed aut qui dolor aut aut eos quam itaque fugiat autem perferendis repellat harum eum aut enim nihil fugit ut velit et illum saepe ullam iure sequi perferendis qui vitae nesciunt nulla explicabo culpa quae maiores excepturi doloremque omnis ut id dolorum qui et ea sed veniam nobis et qui est magni debitis quis dolorum molestiae repellendus nobis cumque mollitia placeat fugiat optio consequatur atque accusamus qui sed atque qui ex aut voluptatem sunt consectetur odit at et neque ipsum soluta ipsum ratione qui quasi natus error cumque et laborum ullam delectus quia magnam id numquam nemo quia voluptate harum enim voluptatibus ipsum laborum dolores dolor iusto odio est explicabo voluptatibus optio sit qui qui sed architecto ea nesciunt doloribus excepturi omnis fugit consequuntur autem et enim libero voluptatum ut ratione autem animi facere ipsam rerum corporis ea distinctio cupiditate ut ex sit reiciendis odit porro et reiciendis tempora labore a eveniet et eos quo voluptas in officia nemo odit itaque eos porro quam necessitatibus minima perferendis qui consequatur repellat similique temporibus veritatis sed dignissimos quaerat molestias fuga reprehenderit magnam fugiat dolores aut fuga dolor eligendi dignissimos nobis et et tempora dolorum rerum architecto iusto nam qui atque error quisquam voluptas harum consequatur ut minus dolor impedit debitis ut aut aspernatur minus voluptatem veniam quo eius dolore beatae natus dolores distinctio reiciendis eos dolorem nihil non odio voluptatem incidunt quas et voluptatem adipisci dicta ea ea deserunt perferendis consequuntur cumque impedit odit et in aut iusto eos animi accusantium fuga suscipit maxime modi qui provident iure ut aliquid sint sed pariatur inventore sed nemo excepturi impedit est accusantium itaque libero deleniti maxime praesentium consequatur expedita eius ea asperiores eum dolor sint rem sed blanditiis voluptas odit dolorem iste sunt corporis saepe molestias rerum eius sed eaque possimus at id dolore aperiam quas dolor est placeat tempore aperiam modi et quia cumque qui mollitia perferendis nisi molestiae soluta consectetur et porro in beatae atque voluptas dolorem est nihil ipsa enim.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('704', '5', 'Sint est possimus iusto omnis itaque.', 'Assumenda accusamus voluptas tempora illo qui in dolor ratione et in rerum similique quae earum voluptatum iure facilis voluptates id dolores corrupti omnis architecto itaque praesentium aut totam quo et labore soluta velit molestiae voluptatem est molestiae cupiditate deleniti cum quis ut sit sint corporis quis nam dolorem cumque quae et quae et voluptatem eos soluta debitis praesentium corrupti deleniti molestiae harum repellat quis dolor tenetur at deserunt necessitatibus quisquam aliquid quidem sit distinctio deserunt maxime explicabo laboriosam reprehenderit ut aut et occaecati error animi perferendis recusandae magnam perferendis accusamus quae minima modi illo repellat impedit eaque laborum iure velit officiis eum eaque quia eum reiciendis iusto at molestiae asperiores voluptas eum dolorem consequatur facilis ipsum exercitationem veniam consequatur ut nihil ab vitae vero qui vel beatae aut nemo amet dolorem minima facilis molestias ex explicabo cumque alias maxime qui qui aperiam commodi aut quis consequatur molestias quam id et expedita enim sint necessitatibus soluta sint doloribus et corporis nihil et laborum corrupti aut et blanditiis incidunt facilis ut quo harum odio est et voluptate dolor aut possimus quis dolor est tempore animi deleniti cum dolore nihil pariatur harum necessitatibus dicta nihil ad est et harum quo numquam et delectus nisi unde et cumque minima veniam impedit autem ut possimus quia esse ut laudantium numquam a quidem omnis rerum officiis ut culpa quia velit corrupti in vero soluta possimus ad quis ipsum dicta id dolorem non qui nam nihil neque cupiditate nostrum ut sunt ipsam eos qui ut consequatur enim odit praesentium expedita officiis est quos voluptas officia ea et voluptatem enim aliquid facere placeat cum quia pariatur velit natus aut quasi laboriosam iste fugiat est facere sunt nihil vero velit dignissimos qui quas doloremque magnam ad repellat non.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('705', '10', 'Nihil enim saepe esse eligendi.', 'Praesentium sapiente quo rerum nemo in sit rerum officia aut ullam culpa et ipsum qui tempore corporis et culpa et quidem accusamus laborum culpa nam doloribus adipisci et molestias at natus at maiores fuga laboriosam iusto consequatur facilis voluptas animi repellendus animi esse magni voluptatem corrupti consequuntur molestias qui commodi nobis maxime ea rerum voluptas et aut id aut exercitationem ut odit quasi possimus rerum aut fugit maiores dicta itaque repellendus animi aut mollitia vitae a nulla quo natus qui deleniti dignissimos deserunt molestiae dolorem unde quod sed dolorem exercitationem rem quaerat nam aut in dolore corporis eum odio facilis dignissimos qui blanditiis ex enim cumque quia debitis aperiam cumque labore deserunt ullam et id aperiam enim ut soluta perspiciatis deleniti mollitia fugiat voluptatem ipsum ullam quo qui ad officiis autem reprehenderit et enim vel sunt ab reiciendis eum quam commodi ex quod et sit impedit dolorum eum iusto aliquam est nobis quam reprehenderit ullam alias officia iure quaerat voluptate possimus et id porro ut sunt libero aut sit reprehenderit aut exercitationem eveniet enim atque ex velit mollitia veritatis qui architecto.', '0', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('706', '10', 'Quaerat aliquid et deserunt suscipit voluptatibus.', 'Beatae laborum omnis cupiditate voluptas nulla earum laudantium ipsam consectetur blanditiis non assumenda voluptas saepe adipisci rerum tenetur nisi qui eius laborum omnis voluptate delectus error fuga neque laborum possimus cumque quia non at voluptatum veritatis et officiis maiores eos unde est deleniti quasi consequuntur porro odio hic tenetur provident sit dolor soluta ratione voluptatem aut ducimus vero adipisci distinctio atque quidem animi qui architecto officia quisquam dolores fuga eum quisquam architecto molestias culpa voluptates quisquam fugit iusto ea autem in quos libero ratione quos quia veritatis fugit laboriosam ab ab itaque perspiciatis et corrupti voluptas officia labore et aut earum nam sint expedita eveniet id id cupiditate rem quo optio et consequuntur quis voluptatibus voluptas sed laudantium suscipit unde voluptatem veniam nesciunt id autem repellendus qui necessitatibus sequi omnis alias incidunt amet omnis itaque eligendi omnis et tempora expedita optio rerum assumenda autem enim facere architecto odio dolores unde laborum deleniti laboriosam eos ut qui eligendi est in dolor hic modi asperiores dolor perspiciatis voluptatum ea ad aut adipisci et alias et officiis quia natus expedita doloremque et eligendi facere asperiores aliquam repellat saepe ut ducimus ea animi fuga sit corporis provident accusamus aut sapiente accusantium sed eius adipisci corrupti est tenetur atque enim neque amet voluptatem recusandae cum quia quia ut soluta temporibus ut ipsam labore natus quibusdam est blanditiis dolor eum quod numquam sit aspernatur consequuntur illo sapiente omnis expedita dicta et laboriosam itaque aliquid facere ullam quia nesciunt quia qui voluptas et in aspernatur inventore quam optio rerum maiores pariatur quas sit ad et ex possimus voluptatum qui reprehenderit dolores voluptate et non enim autem odit rerum reprehenderit numquam quaerat dignissimos aut aut ut et beatae quas illo omnis ea tenetur quidem consequatur doloremque in quasi excepturi adipisci sequi sunt odio facere non et vel amet dolores doloribus repudiandae earum illum molestiae deserunt unde molestias excepturi assumenda porro ut quaerat dolorum esse quia quia molestiae qui rem voluptatibus saepe amet non et ut distinctio tempora labore porro autem cumque odio et eveniet soluta et rem iste distinctio possimus aut harum nostrum est voluptatem officiis rerum voluptas eos praesentium beatae vero et aut provident iste dolor a ullam aut ut esse adipisci est cum autem fugiat sint et sit quis reiciendis sed sint aut et eius voluptatem necessitatibus nemo aut corrupti quo nulla consequatur alias nobis repellendus animi ea dolore omnis laudantium eius cumque.', '0', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('707', '9', 'Consequuntur sed quia nihil totam.', 'Quasi aut accusamus et quaerat non quasi fuga adipisci ab aliquid dignissimos sit asperiores voluptas et et odio quia sapiente nisi hic dolores id ut nobis ad magni aspernatur illum sed vel natus cumque ipsum qui eos unde laborum sit rerum provident consectetur qui pariatur ad rerum fugit eligendi officiis quo corrupti deserunt dolorem aut provident eos ea autem numquam aut itaque ducimus a sit officiis recusandae quos labore in laborum velit maiores consequatur voluptas nihil qui quidem quod ut reprehenderit voluptas ipsa quis reprehenderit vitae pariatur possimus velit et illum qui recusandae in voluptatem voluptatem quis quo adipisci quia ea recusandae explicabo libero quos qui enim non non beatae esse deserunt reprehenderit in magnam qui quis ipsa nisi vel qui laboriosam quam voluptates cumque optio repudiandae harum similique aspernatur illum consequatur minus voluptas officia est rerum illum nisi impedit aperiam perspiciatis ipsam quia delectus qui et omnis qui eos minus quae quasi minus ducimus omnis eaque provident voluptate et voluptatum velit autem perspiciatis vitae ducimus necessitatibus libero libero mollitia tenetur dignissimos at ratione porro velit aut consequatur consequatur voluptas adipisci et dolor hic atque suscipit dolores quaerat rerum facilis corporis atque autem inventore ut quia error fugiat architecto atque cumque nam deserunt rerum dolores in maiores quia qui pariatur voluptatem tenetur corrupti et consequatur voluptate eveniet accusantium culpa voluptates doloremque illo suscipit minus ea repellendus laudantium iusto soluta ullam numquam itaque nobis ipsa recusandae omnis et totam non laudantium officia eaque architecto expedita cum ipsam et debitis ut voluptatem animi aliquid et nihil et dicta dolor laboriosam enim iusto distinctio sit tenetur maiores sunt voluptate aut veritatis omnis qui aliquam voluptates distinctio quis rerum rerum placeat dolor quasi qui earum sed deserunt nesciunt quos architecto fuga eos omnis molestias nulla cum fugiat vel officiis quibusdam vel rerum voluptatum aut soluta voluptatibus voluptates et et repellendus soluta et cumque omnis doloremque ut omnis sit voluptas illo id sunt voluptatem voluptatem quasi dolore quia rerum autem similique assumenda et omnis qui rerum quia qui sequi voluptas expedita ab numquam neque ipsam commodi aliquid impedit minus quis in temporibus nihil esse recusandae ipsam aliquid similique consequatur officiis fugiat eos harum beatae eos ad quisquam dolor non neque saepe perspiciatis reiciendis fugit explicabo cupiditate molestias et consectetur consequuntur ex impedit minus maiores est itaque aut.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('708', '4', 'Vitae delectus dignissimos nostrum et inventore.', 'Ex dolores distinctio quasi est omnis sunt nemo sunt pariatur dolorem a necessitatibus soluta in ullam dignissimos quia doloribus veritatis fuga ipsa tempora quos occaecati quasi dolor eius dicta eaque a maiores velit porro iste unde corporis omnis modi qui dignissimos nostrum velit quia quas sunt neque est error maiores enim ea nihil dicta ea quae sit fuga sed magnam unde recusandae quasi sapiente sit quis ut quis deleniti nam voluptatem nesciunt iure praesentium eius commodi placeat dolor minima accusantium ab vitae voluptas unde veniam quia est sunt sed dolores distinctio ipsam repellendus dolor dolores nemo numquam temporibus at voluptas qui rerum nisi excepturi dolore non tempora incidunt consequatur numquam omnis quaerat error est cupiditate est pariatur dolorum officia voluptatibus et nulla dolor nam tempora aut optio id itaque nihil expedita sit alias a et est quia dolores ut voluptatem et minima rerum ratione mollitia vel ut corrupti aut enim quisquam blanditiis tempore quas rerum ut repellat voluptas ut velit deleniti minima et reprehenderit sapiente aut debitis quibusdam tenetur sunt id pariatur porro ut nostrum laboriosam accusamus sed quia a itaque voluptates accusantium qui velit consequatur qui perspiciatis et consequatur quia laboriosam quos sit ipsa nulla aliquid est velit sint ducimus eligendi itaque quo numquam autem autem cumque voluptas amet porro esse id magni est omnis et doloribus culpa reprehenderit vel ad expedita aut soluta impedit quis accusantium esse accusantium sint repellat quaerat autem ipsa dolor esse quia recusandae dolorem nam dolorem quod ipsa odit corporis rerum temporibus delectus sit aliquam quaerat nostrum consequatur qui cumque quis exercitationem nostrum omnis ipsam odit quia id voluptatem et cum laudantium consequatur eaque placeat quisquam libero dignissimos possimus libero commodi necessitatibus nihil natus ab eum fugiat amet et rerum voluptas fugiat distinctio molestiae cupiditate enim aut nisi provident non et enim id et ipsum dignissimos magnam officiis praesentium temporibus et ullam dolores et fuga ipsum reiciendis voluptate quidem deleniti itaque rerum nostrum nesciunt aut recusandae voluptatem eaque voluptate voluptatibus ea tempore dolores commodi nostrum enim qui id quia non at natus quis et eum laudantium nam odit itaque veritatis cum doloremque ullam officiis molestiae omnis.', '0', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('709', '7', 'Voluptatibus iure in et voluptatum.', 'Nesciunt eius nesciunt quibusdam esse voluptas harum sit officiis dolorum dolorem illo et velit est repellendus voluptatem beatae qui recusandae ea ullam tempore repudiandae autem cupiditate dolor dolore sed modi alias vitae quia aliquid id dolores consequatur quia ducimus doloribus saepe quia aut enim accusantium sunt repellendus aut amet perspiciatis aliquam est vel nam et ex minima itaque rerum minus mollitia autem earum est fugiat corporis dolor est magni distinctio sunt quisquam dolorum et vero praesentium voluptatum provident et est laudantium et ipsa minus consequatur ratione dignissimos eos dolores aut laudantium totam sed dolores voluptas consequuntur unde facilis quia dolor corporis provident ullam sint nihil distinctio quia fuga enim debitis qui inventore consequatur molestias excepturi et aut ut sit vel assumenda aliquam quasi iusto occaecati minus autem in tempore ipsam aut nesciunt sit aliquam velit quisquam atque eligendi quaerat quia facere ut ducimus dolore est molestiae nisi ut optio qui est nesciunt doloremque ut ratione in dolorum et nam molestias quis aspernatur culpa nostrum veniam aut dignissimos est quia repudiandae id quia neque rem culpa ipsam veniam voluptatem adipisci animi non quo omnis nobis numquam minima quis qui sed doloribus atque asperiores eum sed molestias repudiandae reprehenderit et quas consequatur dolore ea accusantium deleniti aperiam odio error amet aut fuga aspernatur debitis architecto numquam est excepturi rerum modi error et non quaerat doloremque quo consequatur harum nobis voluptatem suscipit.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('710', '6', 'Modi consectetur sit voluptas ipsa.', 'Et ut quod qui voluptas omnis dolor non enim optio quas adipisci ab at dolor laborum quia iusto iste praesentium sed rerum nemo vel vel facere qui quia quisquam quam suscipit vero ut harum facilis ullam provident maiores reprehenderit totam voluptates qui veniam sit id architecto accusamus aut deserunt cum ex pariatur dolor maxime occaecati modi aliquam asperiores accusamus animi est consectetur placeat dolor perspiciatis quidem beatae pariatur expedita officia deserunt dignissimos veniam at dolorum explicabo doloribus corporis natus possimus qui atque iusto eum ut deserunt aut quia nihil dignissimos nisi quia omnis iure nihil sunt architecto sequi aut numquam voluptatem corrupti rerum minus illum molestiae qui rerum cumque laudantium et et non officia a est sunt cupiditate et itaque quisquam quasi deserunt quam adipisci pariatur accusamus mollitia non non incidunt non quis aliquam voluptas ipsam saepe iure aut cumque sit iusto est et in aut et nostrum sed libero nisi nulla enim aut beatae sunt ex tempore consectetur quia assumenda sed cupiditate sit distinctio quod sed consequatur consectetur fugit molestiae laudantium ut repellat neque et et consequuntur voluptatum non ab et veritatis accusamus ad et illo quia explicabo perspiciatis aut voluptatem reiciendis et facere placeat exercitationem officia ipsa dolore culpa tenetur doloribus quia quas eum aut eveniet quasi et deserunt voluptate hic aut et id iure deleniti aperiam qui quisquam repudiandae nobis quae molestiae voluptas ab reiciendis magni sunt nihil pariatur iusto et omnis perferendis dolores quidem temporibus nemo aut omnis autem adipisci odit tempore non expedita omnis minus velit esse sed et laudantium quis sed voluptatem fugit itaque et sed omnis aut maiores qui molestiae et voluptatem fugiat fuga ab est consequatur quidem rerum et cum ut magni doloribus reiciendis quae omnis dolor qui sunt praesentium id molestias ut autem quas laboriosam dolores aut nobis odio laboriosam nobis eum ipsa ut ut voluptatem et maxime consequuntur iusto harum magni accusamus officiis nesciunt est sed occaecati esse libero dolorem similique quis facere consequuntur deserunt qui incidunt consequatur temporibus consectetur corporis harum in recusandae esse quas et iusto aut et nam minus consectetur dolores quia nobis aperiam qui odit tempore qui voluptatem ut accusamus qui commodi asperiores eos eos rem dolorem excepturi qui dolores et voluptate nostrum et qui distinctio labore exercitationem ducimus et inventore ipsum et architecto tempora incidunt eos ratione maxime non dolore repudiandae et ratione sit aspernatur et possimus laborum cum optio labore rem delectus delectus modi et ut molestias nobis sed aspernatur voluptatum laborum laboriosam et eveniet delectus.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('711', '10', 'Sed rerum vitae sed ipsa.', 'Provident animi nam et error amet ratione omnis incidunt vitae veniam culpa aperiam hic cum quae a dolor adipisci sit quae nihil et velit tenetur fugit eveniet culpa voluptas officiis non atque in quia eius est quo quo soluta omnis ducimus laboriosam et iusto neque quos dolor ea quia aperiam veritatis optio illum libero id odit temporibus velit et et nam sint tempore minima dolor saepe saepe nobis ipsa porro laborum laudantium libero beatae quasi animi qui cum enim repellendus quo sunt est adipisci reiciendis dolorem mollitia omnis sequi voluptatibus quasi quam ipsam sunt suscipit quia error sed beatae explicabo necessitatibus dolorum autem distinctio quia dolor odit itaque vel quos vel aspernatur optio illo molestias non quidem consequatur fugit perspiciatis tempore facere est nobis numquam omnis repellat debitis et maxime sunt labore impedit saepe dolor quasi neque dolores corporis quod aspernatur necessitatibus maxime maxime accusantium blanditiis aut vel sunt impedit et porro et animi minima enim consequatur ut itaque laboriosam voluptas ratione ad quia sapiente error aliquam laudantium et eaque explicabo delectus placeat ab perferendis velit rerum excepturi vel atque quisquam ad quo eveniet incidunt illo totam sint rerum vel aliquid accusantium atque ex qui asperiores a facilis placeat ad hic quidem magnam voluptates voluptas tempore dolor velit deserunt voluptas natus ut id atque odit culpa nostrum dolorem aut enim harum consequatur magni rerum et reprehenderit sed deserunt fuga sequi dolorem est sit impedit praesentium ut et exercitationem vel expedita rerum modi quidem a voluptas nihil veritatis harum rem ut beatae est iure aut similique et doloremque sit eos fuga et eum deserunt consequuntur animi ut praesentium dolores voluptatum ratione quis et repellat tempore quod magni hic est vel animi necessitatibus nam laboriosam enim et et veniam nulla eos ut minus eveniet quas illum ut et