INSERT INTO `course_news` VALUES ('712', '2', 'Iusto error ipsum voluptatem deserunt et voluptas.', 'Molestiae possimus est quis error deleniti excepturi quis ipsa sint a ducimus reiciendis ea placeat doloribus et provident maiores sit molestiae doloribus voluptas qui earum dolore impedit doloremque necessitatibus saepe eum dolorem necessitatibus rerum dolore voluptatum facere animi molestias qui velit vel sit rerum nemo et qui molestias rem et odio dolor rerum eum amet eius hic culpa nemo rerum repellat ab ratione totam eligendi autem est nam tenetur ut fugit voluptatem nostrum qui rem ut pariatur nostrum veritatis sed aperiam aperiam error vitae et earum repudiandae similique est dolorem vel cupiditate nostrum distinctio ipsum quisquam repudiandae soluta et sit ipsum quisquam quo modi quam voluptatem rerum voluptatem ut voluptate facilis iure fuga porro rem eaque rerum sunt ut ratione doloremque voluptatibus amet enim nihil dolorem qui enim dolor placeat tempore sed explicabo ut neque tempora earum recusandae et at sapiente placeat consectetur est ut ex ullam nostrum delectus animi voluptatibus asperiores unde dolorem ducimus et repellendus alias ea quia ut consequuntur quia dolores et velit enim dicta in est ipsa corporis cupiditate rerum sed iure ad illo voluptate ex aut sed autem nesciunt reprehenderit necessitatibus illo vitae voluptatem et sed nostrum iure qui aut laboriosam commodi quia fugit ea non iste beatae veritatis consequatur dicta et cupiditate unde hic ex neque animi et quis repellat quos voluptatem quo voluptatibus sit consectetur voluptatem quo nihil sequi dolores natus voluptas quidem quo rem nihil vel nihil nihil nulla velit quibusdam dignissimos cum cupiditate dolorem neque in magni qui.', '1', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
INSERT INTO `course_news` VALUES ('713', '5', 'Tempore odio delectus asperiores.', 'Ducimus et assumenda et doloremque adipisci ex porro dicta quo facere rerum et minus mollitia assumenda fugit delectus cumque officiis officiis rerum asperiores assumenda numquam molestias modi enim dolor doloremque soluta voluptatibus id non non impedit et numquam placeat aut temporibus aut mollitia qui sapiente aut nemo voluptates totam dolores voluptatum sit qui laudantium iusto mollitia voluptates quis nihil aliquid voluptas consequuntur praesentium voluptatem debitis quod temporibus qui corporis doloremque sit iure laudantium commodi sit eaque distinctio placeat aliquid qui reiciendis aut quo quia sit magnam aut excepturi quaerat incidunt eum et esse deleniti perferendis similique placeat non ut non officiis consequatur ipsam qui ut ullam porro aut est tenetur amet cumque in sequi sapiente est impedit incidunt dolor deleniti laborum vel molestias aut sed itaque qui doloremque ut id voluptate vel debitis accusantium unde perspiciatis atque qui rerum odio modi ipsa harum totam soluta velit fugit soluta optio aspernatur fugit perferendis quo voluptatem praesentium iste deserunt ad rem impedit reiciendis esse maxime iure dignissimos nesciunt temporibus sit dolores nostrum quia harum dolorem tempora aliquid et sint quis sit similique numquam illo eum velit est ut incidunt qui debitis nesciunt autem nihil voluptatem nihil aut inventore quod et necessitatibus at officia non corporis vel et modi enim corrupti aperiam quod qui perferendis qui voluptatem assumenda assumenda quis voluptas consequatur eum quis eos suscipit non ut et eos occaecati esse id quia fuga quidem autem expedita ea illo adipisci laboriosam distinctio nostrum doloremque beatae vitae voluptas laboriosam sed minima est tempora fugiat minus incidunt quidem eveniet eius quo nam asperiores aperiam ea dolorum assumenda magni quam atque exercitationem dolorem laboriosam dolorem dolorum optio dolorum quod dolorem ut nostrum a