INSERT INTO `course_news` VALUES ('714', '9', 'Consequatur porro quos voluptates fugiat accusantium enim dolor quae.', 'Quo laudantium optio officia dolor dolores ut exercitationem suscipit voluptatem id recusandae sed ea voluptatem rem doloribus amet non et eveniet corrupti consequatur ipsa rerum odit omnis est architecto et non quae et nostrum ea accusamus eos aliquid est quibusdam id amet sunt a laboriosam optio molestias qui ratione aut voluptate consectetur eaque ratione aliquid officia illo repellendus quibusdam deleniti autem tempore perspiciatis ut eligendi voluptatem quo at incidunt vero quia nobis id magni qui nam natus qui fuga et sed sit et odio rem quam id et atque nemo autem excepturi possimus eos tempore labore eligendi quia accusamus et velit corrupti sequi voluptatum quod aut voluptatem quia qui nobis assumenda odit et consequatur fuga quibusdam quis fuga quia sit consequatur illum quia ea qui quis aliquid omnis exercitationem laborum cum incidunt deleniti qui illo velit porro aut voluptas aut ducimus deserunt rerum consequuntur distinctio consequatur commodi et modi qui recusandae error fugit quos molestias nihil voluptatem et ut dolore ut odit nihil rerum sunt deserunt expedita impedit enim amet modi velit doloribus mollitia cumque rerum exercitationem doloremque nemo quod nihil id velit vel excepturi qui odio quidem doloribus quo necessitatibus nobis incidunt delectus et quia quae fuga vitae eligendi vel sunt amet adipisci ea saepe qui consequuntur non et maxime nam ut provident et molestias consectetur qui magnam hic laboriosam odit voluptatum ducimus ullam voluptatibus id ea officiis consequatur molestias odit accusamus nulla est necessitatibus sint ullam excepturi repellat voluptatibus totam provident eos facilis delectus et veritatis qui doloribus aliquam nesciunt rem et fuga autem qui non aliquam dolorem provident aut doloremque consectetur consequuntur soluta omnis enim consequatur velit aut necessitatibus saepe aliquam placeat perferendis omnis minus qui aut et et iusto et excepturi quis eveniet qui quis aut blanditiis voluptatem harum quisquam et est iusto architecto quidem quia fugiat eum non voluptatem odit qui quam et iusto ullam enim ipsum ut accusantium alias eveniet suscipit modi sed consequuntur architecto aut voluptatibus inventore ratione non est officiis quam ipsum repellat id aut et dolor velit aliquam labore accusantium vel nisi sit ut nesciunt iure minus et aliquid quibusdam dicta impedit explicabo impedit minus assumenda nihil illum consequatur et id quam quia et consequatur molestias maiores voluptates rerum odio voluptatem necessitatibus harum fuga vel ut et qui non earum sunt accusantium et doloribus dicta suscipit quae ea adipisci recusandae libero maxime dicta ut nostrum praesentium vitae quibusdam consequatur aspernatur quibusdam ad fuga minima ut sint esse qui dignissimos ullam molestiae aut earum praesentium voluptatem optio qui est rerum adipisci unde deserunt.', '0', '2017-05-02 22:59:26', '2017-05-02 22:59:26');
