INSERT INTO `course_news` VALUES ('716', '2', 'Quis dignissimos rerum et et totam voluptas.', 'Sunt tenetur dolores ex voluptatem adipisci est molestiae cum consectetur maxime rerum sed mollitia sed facilis occaecati occaecati autem quia saepe voluptatem sed repudiandae quia consequatur consequatur laudantium aut consequatur quo consequatur modi ut ea deserunt in id est rem porro aspernatur totam deleniti aut est perferendis sed facilis corrupti enim possimus voluptatem consectetur repellendus enim eos eligendi ea tempora fugit nihil nam recusandae at totam corporis ipsa laborum tenetur ipsa et quasi quibusdam iure in veniam iure facere nulla porro ipsam excepturi non nesciunt consequatur et quam sed ipsum voluptatem ut eos aut cupiditate necessitatibus sed quia ut impedit corrupti hic voluptas ea sit sapiente eum molestias doloribus nostrum natus iste aliquam ea dicta aliquid qui eaque modi quam reiciendis consequatur consequuntur omnis rem ut aperiam animi assumenda itaque et ad similique quis vel rerum cum ea fugiat explicabo delectus sed eius reprehenderit aut ut consectetur quo aut odio ab consequuntur voluptatem ab perspiciatis maxime ad voluptatem est et sunt iusto corrupti qui quisquam quis sint et est dolorem est rerum vero minus velit tenetur qui animi tempora eos accusamus nesciunt eveniet sequi vitae beatae facilis doloribus aut est cum sequi placeat qui cupiditate incidunt maxime sequi quisquam sapiente magni quaerat cumque veritatis aut sint adipisci quis atque omnis aut voluptas laudantium omnis sunt qui facere ipsum rem veniam sit autem consequatur reiciendis ad quod molestiae quas reiciendis autem beatae omnis dicta et provident repellendus assumenda est qui officia voluptatem adipisci doloribus nulla qui incidunt delectus rerum dolorem ut fuga molestias dolor eos autem molestiae voluptatem quia voluptas deserunt aut voluptatem sed qui et consequatur quod suscipit qui velit deleniti aut voluptate dolore quam asperiores aperiam voluptatum perspiciati