INSERT INTO `course_news` VALUES ('717', '10', 'Id officiis tempore deserunt vel sed dicta et nam.', 'Deserunt corporis eius dicta amet eum cum error dignissimos aut et voluptatem illum odit est cum repellendus id labore et natus et aut cupiditate facere deserunt error exercitationem et assumenda ullam sit similique nostrum ut voluptatum odio voluptates modi vero et debitis dolor ut vel reiciendis officia quia architecto a suscipit magnam sit suscipit ut optio eaque corrupti quaerat minus corrupti mollitia ea sapiente culpa magni enim sed repellat molestiae non ex sit amet voluptatem qui aut adipisci adipisci est magni sint est fugiat consectetur rerum praesentium tempore quo eaque maiores pariatur vel deleniti veritatis dolor at non odit id qui aspernatur quis veritatis vero animi laborum rerum commodi hic aut debitis quas praesentium voluptas ratione omnis tempora ea id voluptates aut et voluptate placeat culpa eos rerum et sunt debitis quibusdam totam qui rerum sequi voluptate aut rerum assumenda ipsam quis cum aut qui ad sint et beatae consequuntur dolor voluptatem consequatur itaque rerum aperiam et voluptate dignissimos nemo doloribus amet est enim itaque optio et aut saepe explicabo quaerat error mollitia aut nulla deserunt sit adipisci perspiciatis molestias non impedit nemo expedita itaque est non tenetur in eligendi qui labore cupiditate quia eius pariatur aspernatur fugiat pariatur animi labore et repudiandae sit omnis omnis laboriosam nam magnam veritatis quia ut id aut sint beatae vel libero repudiandae aliquid dicta id assumenda doloribus culpa consequatur autem harum sit quaerat repellat neque facere impedit doloribus aspernatur at magni et quae et repellat dolor quidem omnis non aut molestiae voluptas aliquid deserunt et praesentium illum ducimus numquam quis voluptas est voluptatum ullam quaerat vel accusantium dolorem iste aut illo fuga voluptas deleniti rem odit voluptas neque cum sint rerum explicabo sapiente temporibus veniam dolorum voluptatem 