INSERT INTO `course_news` VALUES ('718', '1', 'Praesentium exercitationem quam sunt ut error non autem nemo.', 'Possimus consequuntur sed consequuntur sed eos ea minus eum iusto quis odit dolorem hic officia quod perspiciatis facilis quo sapiente nam consequatur sunt aliquid ut cupiditate quis sunt harum et veniam assumenda sit possimus eum qui quae ea ab est aut rem ab reprehenderit animi minima molestias tempore in eaque ea fugit sed debitis sed provident voluptatibus fuga accusantium quaerat aliquid dolorem occaecati in nesciunt unde consectetur sed quo voluptatum aliquam labore laboriosam impedit maxime repudiandae odio sed nam qui deleniti qui sapiente sed culpa ea nisi voluptatum voluptatem autem labore quaerat sed velit et et sint et officia tenetur dolorem soluta sit beatae aut perferendis illum distinctio aut ipsum nulla odio ducimus non cum explicabo molestias officiis quidem sed accusamus labore voluptatem modi molestias ducimus nam ut ut autem provident deleniti qui quia illum molestiae numquam dolor sunt aperiam dignissimos voluptas facilis hic laudantium velit qui atque veniam temporibus consequatur ducimus id totam sapiente non corporis eos asperiores itaque et quas reiciendis rerum ducimus soluta mollitia mollitia ut rerum laudantium ipsa autem harum et alias non autem eligendi et enim aut ipsa facilis assumenda iusto molestiae placeat ad ea sit explicabo tempore sapiente dolorem nesciunt minus iste quia voluptas deleniti quaerat praesentium saepe deserunt voluptatem soluta consectetur non ducimus et est ut nulla qui animi voluptatum non et dignissimos aut eum enim architecto vero ut quisquam beatae ea temporibus dolorem ullam qui quo aut et quia ipsam commodi sequi non.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('719', '8', 'Vero sed eveniet molestiae et.', 'Sit occaecati doloribus voluptatum perspiciatis totam distinctio eos tempora et nostrum exercitationem porro perferendis quod quasi aut non vel illo deleniti architecto cum omnis repudiandae non quod qui repellendus pariatur optio minus maiores assumenda iusto aut accusantium temporibus eos in omnis facilis eaque et rerum voluptatem deleniti occaecati nihil sed ut ut necessitatibus voluptatem illum laboriosam dolorem totam consectetur veritatis blanditiis aut ad quibusdam animi beatae est qui non earum itaque nihil et minus cumque consequatur voluptates rem exercitationem quae voluptatem vitae qui distinctio et ea facere quis eligendi explicabo reprehenderit est vel velit natus aut ipsum sit voluptatem deserunt dolore dicta cum quia nam minus et nobis quos dicta dolorum sint eos voluptatem consequuntur corporis consequatur exercitationem earum velit qui autem fuga hic repellat maxime blanditiis nam ut voluptatem reiciendis delectus ut quisquam autem est sunt ipsam quis dolor tempore odio non alias velit voluptates quod consectetur tempore at facere omnis consequatur voluptatem eius vitae sit ut earum sit a modi error et veritatis asperiores esse iste cum ipsum asperiores veniam eos ipsa ea error officia voluptatem illo laborum officiis id repellat itaque qui accusamus soluta quo qui modi sed qui nam culpa rerum aut maxime delectus exercitationem omnis esse eligendi quia vero et sed earum neque error natus ut saepe excepturi velit aliquam dolor earum omnis tempora aut consequuntur illum quibusdam qui soluta et cum non facere ut beatae eum ut saepe ut et et vel ut porro nemo porro explicabo quia architecto et autem eaque quod sit quibusdam dolor et et deserunt et dolorum occaecati qui amet repellat dolore maxime necessitatibus natus vel sequi suscipit sit id quae porro nesciunt vitae et numquam distinctio ullam perspiciatis dolorem ut velit et tempore quia expedita itaque est animi conseq