INSERT INTO `course_news` VALUES ('720', '7', 'Pariatur deleniti consectetur quas iste.', 'Sed sit et reiciendis occaecati rerum quis est quaerat accusamus reprehenderit in numquam quidem ea nostrum et inventore sint temporibus qui et maiores expedita recusandae dolor earum animi aspernatur et repellendus quia rerum vitae voluptatem esse veritatis iusto id voluptatum rem nihil eum laudantium nostrum quia laborum dolorum voluptate doloremque accusamus explicabo optio rerum et quod quae molestiae sunt odio culpa voluptates explicabo debitis illum atque sunt voluptas earum iure aut maxime consequatur cum laboriosam ut impedit nostrum itaque dignissimos a molestiae doloremque omnis qui reiciendis repudiandae doloribus neque enim ut voluptatem iste est aut accusantium atque quia et voluptas animi quisquam et exercitationem hic possimus consequatur amet sapiente dolore facere a debitis non pariatur sequi dolorem consequatur vero sint aut consequatur ex reiciendis corporis quod inventore neque est sit perspiciatis beatae amet laboriosam ea iure ad quis magnam vitae porro nostrum aut pariatur omnis et quo ducimus voluptatibus architecto qui voluptatem quos veniam minus sequi recusandae quis accusamus cupiditate quae itaque aspernatur quas laborum sit odit sit illo ut quas dolorum ipsam non aut voluptatem quia optio rerum deserunt deserunt voluptates qui officiis cum et doloribus sit occaecati qui praesentium autem asperiores ab consequuntur nulla asperiores harum iure ullam et at et laudantium aut in voluptates illo earum dolorem et cum voluptas doloremque hic maxime est voluptatem omnis magni sint voluptatem aliquid voluptatem neque temporibus nihil sed saepe ut enim nemo minima est ex quas laboriosam molestias nihil consequatur ducimus veniam aut et ipsa fuga asperiores aut rerum similique aliquam eos illo id neque optio commodi deserunt minus consequuntur necessitatibus nobis dolor ut laboriosam voluptates temporibus ullam nesciunt tempora quia dolore nulla quia dolor qu