INSERT INTO `course_news` VALUES ('721', '2', 'Et enim laboriosam et eveniet labore non.', 'Dolores quo repellat eaque fugiat cupiditate nulla sed perferendis odit voluptatum cum et quod mollitia cum eos laborum itaque quod esse et vero repellendus nesciunt facere dolores odit pariatur dolore nam vitae dolor non eius repellendus eius quo corporis iste provident qui distinctio omnis cumque quis omnis voluptas labore adipisci sit pariatur et fugit consequatur et temporibus omnis velit veritatis pariatur quia voluptatem expedita explicabo qui ab tenetur aliquam sint laborum natus qui commodi voluptas rerum eum sit doloribus recusandae nobis debitis vero veniam qui consequatur atque qui molestias earum cumque blanditiis placeat esse tenetur voluptas amet molestiae nobis et et culpa numquam consectetur voluptatem nulla fugit ducimus vel et aliquam enim error minus ipsum occaecati ut provident eligendi similique et quia consequatur mollitia nulla similique sint nobis commodi et nostrum necessitatibus enim distinctio sed dolorem odit impedit occaecati provident sit et fugit exercitationem qui rem itaque ducimus veniam distinctio sunt distinctio impedit et dolorum voluptatem nihil repellendus sunt voluptate ducimus molestias laboriosam a ut unde veniam optio vel et aliquid rerum alias ipsam corrupti fugiat vitae neque omnis saepe consectetur dolorum qui mollitia assumenda officia laudantium a voluptatem molestiae magnam itaque consequatur quibusdam quam est et reprehenderit adipisci consequatur aperiam et iure nisi sunt laborum saepe delectus impedit cumque unde debitis qui harum saepe ipsam sint architecto qui aut architecto a dolor enim incidunt facere tempore ut aut laboriosam ex nihil dolores culpa voluptate quos eos consequatur repudiandae ipsa quis debitis voluptas quod repellendus repellendus exercitationem possimus est enim soluta qui eligendi vitae exercitationem repellendus vitae accusantium repellat est aperiam consequatur temporibus consequatur ad cum dicta id e