INSERT INTO `course_news` VALUES ('722', '1', 'Soluta ea magni pariatur tempora ut praesentium quasi.', 'Totam molestiae voluptate qui veniam aut quae natus voluptatem molestias in illum exercitationem totam dolor corrupti voluptatum debitis aspernatur est et voluptate perferendis quos commodi voluptates a eveniet veniam iure deleniti nihil dolorem eveniet saepe esse placeat odio est id reiciendis esse assumenda aut temporibus odio corrupti unde earum sit repellendus vitae voluptates quia soluta numquam qui vitae quo eum enim excepturi et doloremque rem adipisci ad expedita dolores sed odit itaque magnam est est aut ut tenetur provident consequuntur ut sit harum iste neque hic recusandae enim eligendi quisquam id deleniti nihil minus et sint cum ratione at labore provident aliquam sit vero culpa est inventore iure facilis aut ut tenetur nihil expedita excepturi ipsam est animi aliquid dolore dolores velit est ut sed sed sed commodi aspernatur deserunt libero eos blanditiis est sed deserunt tenetur ut nihil qui voluptatem iure ratione ea animi corrupti iusto laudantium nobis non vel dolor dolores eos impedit cumque non quidem voluptate laboriosam voluptatem consequatur nemo inventore veritatis facilis maiores et rem molestiae doloribus hic ut incidunt dolores commodi quos blanditiis quaerat qui et ducimus et voluptatibus et nemo quam officiis modi corrupti nam eligendi alias similique unde rerum enim quo dolores repudiandae occaecati cum odit voluptatem enim iure suscipit et minus ea pariatur qui qui eos nisi facere enim enim in tempora non asperiores voluptatem illo qui optio rerum vel tempore culpa velit cupiditate neque cupiditate quia sed blanditiis provident et officia provident corrupti cumque tempore voluptatem adipisci nihil quaerat consequatur et eligendi repudiandae et et voluptas nihil qui debitis eos inventore voluptatem minus dolor quibusdam repellendus id omnis cupiditate doloribus vel molestiae nostrum assumenda dolor minus molestias non est error nihi