INSERT INTO `course_news` VALUES ('723', '4', 'Officiis sed est impedit cupiditate atque voluptate.', 'Quasi quisquam error eum sit aliquam aut molestias ut ad ut sit consectetur minima et aut omnis dicta excepturi dolores voluptas et nisi sit provident aut doloremque sint aliquid expedita eius quae est labore beatae consequatur repellat voluptate velit ipsa est architecto soluta enim debitis fuga eum qui autem omnis voluptatum sunt est quo in est molestiae qui expedita atque unde voluptas adipisci consequatur molestias eaque numquam perspiciatis dolorum sit ut nam laudantium aperiam magnam porro repellat doloribus aut ex consectetur nemo reiciendis earum sit alias sit quas qui doloribus architecto voluptatem repudiandae voluptas consectetur ullam saepe voluptate ea veritatis cum vel sunt possimus sit a eligendi iusto magnam iure et repellendus fugit velit accusamus et commodi odio corporis quia doloremque voluptas id totam quo doloremque ex sed et id est est dolorum hic molestiae voluptas reiciendis et sed recusandae et sunt cum culpa est occaecati quis enim aut provident odit ut quaerat cupiditate molestias et error distinctio eveniet voluptas non reprehenderit numquam quia vitae est quos laborum atque quas ipsam ea velit assumenda quasi sint ea unde quae aut aliquid officia omnis quia ad iusto rerum iure deserunt illum ut aperiam a repudiandae molestias dolorem accusantium voluptatem quisquam suscipit nihil maxime sapiente voluptatem error omnis odit pariatur ex culpa iste architecto assumenda aliquam sint voluptatibus distinctio possimus hic ducimus earum quia magnam quam ea est beatae recusandae voluptates ipsum aliquam vel fugit velit repellendus facere laboriosam voluptatem veritatis consequuntur consequatur quam qui voluptate iste velit quia accusamus voluptatem recusandae et voluptas atque et vel perferendis totam modi eos illo sed ut veniam excepturi totam quae ipsum quia.', '1', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('724', '5', 'Ut dolore sint exercitationem officia non quas reprehenderit ut.', 'Quibusdam aut sapiente quasi iusto doloribus sint qui dolore ipsa et incidunt tempore deleniti sint exercitationem omnis blanditiis beatae necessitatibus omnis omnis incidunt libero voluptas ea dolor distinctio sed unde rem rem deleniti deleniti et eos sed eius vitae ea molestiae consequatur autem et officia molestias hic voluptatem aut impedit exercitationem vel qui excepturi et harum similique impedit at ipsum occaecati voluptatem ea cupiditate consequatur ipsum accusantium quia sit molestiae alias sed delectus ea quo in ut aut quis aut eos libero est animi in et repellendus sed laborum totam magnam quisquam rerum rerum non perspiciatis eos perferendis quibusdam sapiente quidem sunt sequi rerum reiciendis explicabo adipisci sit voluptate dolore pariatur libero similique dolorem saepe in blanditiis qui dolor vitae saepe eum est ea tempore necessitatibus similique dignissimos velit unde aliquid dolorum quo ea beatae in reiciendis iusto qui ut laboriosam qui cum assumenda vel eveniet velit et quos ipsam nulla in neque corrupti rerum error voluptate molestias vero suscipit quis et error odio occaecati accusamus harum et at dignissimos veniam qui assumenda et hic corporis eum aperiam unde fugiat qui saepe officia perferendis fugit assumenda dolore ut tempora ut tempore reprehenderit voluptas ex qui quo eveniet corporis ea vero eos velit quidem et sit quis amet quo.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('725', '2', 'Enim non praesentium exercitationem dolorum occaecati.', 'Ut vel neque velit harum doloremque tenetur quidem laudantium ut porro non id cupiditate numquam corporis possimus velit eos est accusantium aut aspernatur sed consectetur veniam voluptatem facilis laboriosam sed necessitatibus cupiditate eum ut tempore tenetur et laboriosam quam qui dolore qui eligendi sunt occaecati excepturi maxime autem velit eveniet possimus quia officia adipisci amet delectus officiis vitae asperiores aliquid dolore voluptate ipsa quo consequuntur similique neque sed distinctio aperiam est vel eveniet qui distinctio eius adipisci ipsa molestias veritatis voluptatem nobis suscipit aspernatur delectus non ut inventore ullam exercitationem tempore dolor nesciunt odit earum rerum laborum quo nihil officia est consequuntur vitae cumque consectetur illum laborum consequatur et et ut est eligendi amet voluptas reiciendis accusantium laboriosam blanditiis ab quia aut veniam odit optio corrupti quia officia quod ducimus nemo nesciunt voluptatem atque omnis nostrum nemo praesentium error tempore rerum delectus aut vero nesciunt non facere vero in commodi dolor quod non et explicabo veniam quae in doloremque ipsam sed aut vel quam iure corporis omnis hic at ipsam pariatur voluptatem inventore et ea illo fugiat vel est sit optio inventore tenetur velit officiis nisi repellendus rerum perferendis beatae sit sit animi numquam rerum voluptatem officiis libero molestiae provident mollitia quisquam blanditiis consequatur reprehenderit nemo officiis maiores eius et voluptas et ipsum inventore placeat cumque aut consequuntur qui dicta voluptatem minima suscipit eos harum ullam eos consequatur voluptatem assumenda a provident ipsa distinctio est ut voluptas ab et autem nemo reiciendis et distinctio non consequatur eum omnis aut et eum eum quae earum nihil voluptatem numquam culpa quasi quia quia reiciendis reprehenderit et ut vel sapiente neque ut recusandae ut nostrum sit eius et suscipit ut quia et sed dignissimos veniam modi nam numquam nemo doloribus deleniti autem aut accusantium ullam illo enim velit sed fuga et voluptas placeat quia repudiandae sed dolorem perferendis ut ex illum cum qui dolorem cupiditate optio error quia facilis voluptatem quis asperiores modi laudantium optio animi a iusto aut perspiciatis quibusdam illo odit provident qui ut non accusantium ducimus quia nisi iusto quaerat odit eligendi non dicta ipsa consequatur aspernatur earum quo expedita eveniet ad eum ut ad voluptas id dolor sed voluptatibus id eius illum sint non occaecati quis velit quis qui libero iure iusto similique quam non consectetur autem libero qui fuga est earum unde dolor qui consequatur quibusdam fugit quo modi culpa consequatur deleniti.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('726', '4', 'Harum culpa praesentium eligendi vitae eaque sunt in.', 'Distinctio nemo minima voluptatem autem magni dicta praesentium voluptatem ab odio sit eius id fugiat nesciunt labore fugit quae ad quia accusamus ratione molestias dicta vitae voluptate at iusto quis aut voluptatem omnis excepturi voluptas reiciendis nulla velit nihil voluptatibus quia ea ut laboriosam eveniet quibusdam nostrum veniam illo voluptatibus omnis eos fugiat dolorum sit omnis omnis quae molestiae reiciendis minus qui aut ab facere reiciendis architecto et optio tenetur ut tempora nihil sit dolor adipisci quae omnis architecto laborum hic culpa aut sunt perferendis voluptatum eaque possimus est enim reiciendis autem numquam nisi neque voluptas sed iste quibusdam officia praesentium corporis repellat qui consequatur quibusdam rerum atque eos iusto corrupti enim repudiandae dolorem rerum aliquid fugit hic quia aliquid sit aut eos occaecati libero quo unde omnis qui nam autem cumque voluptas eius distinctio adipisci rem ut dolores ipsa porro esse dolor ipsam dolores autem quam harum nulla ea aut consequuntur explicabo nihil non quo et necessitatibus quam dolores sed et molestiae et fuga corrupti fuga vero qui eveniet quo omnis excepturi repellat delectus ut tempora unde ratione voluptas et eos repudiandae ut quos dolorum unde cum rerum quo et velit assumenda qui non sint.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('727', '8', 'Officiis facere et adipisci enim.', 'Beatae vel officiis itaque id magni repellat tempora neque ratione nulla ea nobis recusandae et corrupti consequuntur nam qui eum voluptatem eaque reprehenderit harum sit incidunt eos id ut at voluptas doloribus ratione eligendi nulla reprehenderit hic ipsum quae pariatur magnam labore est sint mollitia similique aliquid voluptas expedita quis ad molestiae nostrum alias id earum non sit cupiditate eaque consequatur harum eum nisi pariatur at quibusdam sint autem quos enim quisquam est voluptatem vitae sit laborum eveniet harum quisquam et sit ratione beatae quidem molestiae quaerat eaque neque est eum qui tenetur fugit sit nesciunt repellat et nihil nisi ea tempora non officiis quam sit quia aut qui quod cupiditate iste natus et ullam voluptatem consequatur ab fugit hic voluptas et consequuntur incidunt numquam sequi illo velit non esse quia assumenda ducimus voluptate quo vel quisquam eius et fugiat minima dolorum omnis error dolore totam porro nesciunt est libero et provident sed qui aliquid quas quia suscipit dolores quo nihil deserunt voluptatem natus omnis labore animi porro quas alias quam molestiae est voluptatem reiciendis dolorum maiores sunt quis ea hic similique possimus non labore deleniti ut velit et magni ipsum corporis porro assumenda possimus aperiam aliquam natus consequatur doloremque quibusdam est.', '1', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('728', '8', 'Et aut nostrum repellat facilis nesciunt consequuntur perspiciatis enim.', 'Nostrum dolor vitae dolor nesciunt aut ratione magni consectetur fugiat quasi ut vel et officia aut sed repudiandae et ratione aut ipsa aperiam rem porro aut sint ad saepe ratione soluta sit repellendus delectus quidem fugit neque rem aut ab esse animi quis non mollitia quaerat soluta qui deleniti similique cupiditate veniam quisquam impedit hic non aut quibusdam assumenda et hic dicta qui omnis qui ratione sed ea et est qui est et ipsa corrupti placeat ea similique totam repudiandae laborum nostrum soluta et et numquam qui debitis nobis mollitia voluptas incidunt quos cumque dolorem hic fugit ipsum corrupti aut iusto libero est enim accusamus dolor qui eius qui nobis nisi cumque quaerat alias ex et hic unde nihil consequatur consequuntur ut voluptas facere tenetur nulla qui blanditiis debitis qui aut totam velit dignissimos repellat delectus nam ut ut aliquid et asperiores et aut nihil nobis nesciunt et aliquam eum non amet est sint exercitationem ad quae quia labore pariatur quisquam sunt architecto ut temporibus animi voluptatem ea nostrum rerum facilis numquam aut et blanditiis odio et iure est debitis suscipit quisquam consequatur consectetur eaque ea eos dolor reiciendis minus iusto odio reprehenderit eligendi qui dolorum id id rerum neque blanditiis est esse tenetur consectetur qui corporis est fugit quasi voluptatem praesentium perferendis aliquam deleniti enim quae ut rerum recusandae qui hic dolore velit id inventore et voluptas nulla ipsa et sint iusto dolores ad nemo et repudiandae corporis repellendus dolore minima dolorum voluptatum vero explicabo consequuntur velit consectetur voluptatem omnis ut et illum et ipsum cupiditate dolores voluptas placeat molestiae voluptates error omnis quas officiis maiores quis ut quaerat voluptatibus fuga suscipit eos perferendis non fugit illo qui quia blanditiis illum labore minus quam repellat corporis reiciendis sed consequuntur doloribus sit magnam aut voluptatem ut est aliquid temporibus unde a et iste cumque aut rerum soluta dolores molestiae dolores nobis et omnis eum quisquam ipsum eum et aut architecto deleniti ut odit maxime asperiores tenetur maiores non veritatis voluptates repellendus non totam consequatur aut aut quia sit laboriosam optio maiores aut mollitia et deserunt et sunt quaerat quisquam amet eum nemo reiciendis consequatur ut sequi facere distinctio.', '1', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('729', '9', 'Ab accusamus non recusandae eum laborum sed.', 'Dolorum tenetur amet adipisci itaque repudiandae perspiciatis saepe laborum velit blanditiis incidunt consectetur magnam aspernatur voluptates et possimus repellendus laborum doloribus consequatur ratione velit doloribus consequuntur totam aut magni dolores consequatur ratione tempore repellat rerum dignissimos quia repellendus atque aperiam hic nulla labore soluta aliquam quae dolor voluptatem occaecati velit perspiciatis laudantium voluptas molestias voluptates quia nihil hic dicta sint consequatur quod tempore autem voluptates et expedita aut dolor vel veritatis incidunt molestiae voluptatem debitis quisquam dicta nam nesciunt libero provident exercitationem molestiae et possimus atque itaque eaque nisi rerum velit nam voluptas odio libero laudantium voluptate nemo odit doloremque molestias ut sint minus reprehenderit sequi voluptatibus rerum veritatis occaecati facere illo deserunt aperiam soluta eos fugiat saepe dolores qui iure corporis voluptatibus modi illum officia ratione mollitia eos laudantium nostrum et incidunt unde sint minima ullam quidem accusantium aut eaque in deleniti necessitatibus et id reprehenderit impedit molestias omnis exercitationem aliquid repellat a nihil est quas et voluptates quam qui laborum sint reprehenderit ab fugiat qui perferendis voluptates quibusdam saepe at quis quae aut est sint architecto dolor minima dolor quis id sapiente ratione assumenda architecto nam sunt cumque praesentium exercitationem quas placeat id alias explicabo quia reiciendis eveniet quisquam iure dolorem sed et minus vel quidem doloribus quod magnam et repellat perspiciatis iusto facilis aspernatur facilis nostrum assumenda molestiae repudiandae nisi sit vel nisi quis harum sit unde eaque totam natus voluptate corporis exercitationem consequatur impedit nulla ab qui laborum maxime aut voluptas dolores vel explicabo sapiente sit aut exercitationem ad repellat qui est magnam et quis est et consequatur quas inventore est laboriosam nam iste eaque vel omnis eum ut est repellat veritatis ut quo aut molestiae ducimus mollitia animi quos enim quod id quis adipisci temporibus excepturi tempora possimus et enim eveniet dolores aspernatur eos nihil sit illo culpa qui veritatis maxime dolores alias et eos saepe id similique natus temporibus et magni est eum hic officiis quaerat corrupti odio voluptas deleniti iste qui sint harum id ducimus dolores occaecati consequatur veritatis perspiciatis iure repellendus labore quia quam sit debitis sunt officia nisi ea enim assumenda occaecati sit quia eligendi enim qui placeat et et nisi est velit sapiente perspiciatis neque consequuntur placeat cumque quaerat facilis libero aspernatur aut et voluptatem in sequi modi magni.', '1', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('730', '8', 'Expedita iste deleniti est minus.', 'Impedit ipsam rerum qui maxime nihil ea inventore ut sapiente enim dignissimos omnis perspiciatis natus eveniet velit quo maxime ad quas nostrum impedit libero provident aliquam sunt doloribus aliquid rerum doloribus harum delectus unde eum est hic est nesciunt quaerat recusandae magni dolorum rem repellendus architecto cum ex minus dignissimos quo cupiditate debitis sunt harum ut officiis aut veniam magni et sapiente aut perspiciatis vel sint officiis maiores debitis et aut amet quidem ut reiciendis laborum perspiciatis dignissimos aliquid dolor eum exercitationem velit in quaerat maiores eaque qui hic mollitia inventore tenetur officia similique aut laborum architecto adipisci consequatur repellendus excepturi sunt autem ipsam voluptates similique sapiente quaerat natus atque dolores libero laborum et dolorem praesentium illo et velit dicta odio saepe autem quaerat enim dolor id esse quia id assumenda tenetur sit iusto sit rerum sit earum in sunt aut amet deleniti quo quam at quia ex dolores rem laudantium quo qui sit asperiores tempora sunt mollitia quidem voluptates minus laudantium nihil deserunt provident quo omnis sed odit voluptatem et ab minus et quia natus id ea est aut dolore id quia aut numquam adipisci maiores quasi sed est quod fugit ut voluptatem similique nostrum qui consequatur vel vero voluptas itaque minima dicta placeat aut magni odit soluta voluptatem numquam ut quo minus dolor voluptatem corrupti fugit dignissimos provident eos est occaecati quas magni sit ut quaerat quia quisquam possimus eum tempora distinctio pariatur rerum et eos consequatur corrupti error fugit perspiciatis pariatur eaque molestiae dolor sint et veritatis consectetur optio quam est ut quo et corporis voluptatem voluptatem saepe qui temporibus aut ut explicabo eius tenetur porro non alias tempora iure molestias voluptate veniam quia rerum voluptate perferendis aut laborum rerum cupiditate eaque animi aut repudiandae ut qui nam culpa rerum necessitatibus molestiae exercitationem totam tempore rerum vel harum maxime repellat dolores laudantium praesentium non sed sint maxime dignissimos ut doloribus est magnam dolorem rerum reiciendis tempore provident facilis consequatur.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('731', '9', 'Sequi voluptate unde illo alias.', 'Eveniet ut omnis asperiores laboriosam fuga consequuntur laudantium quod explicabo corrupti eveniet quis eum saepe voluptas enim quidem quae repellat recusandae repudiandae magnam veritatis et odio nemo velit omnis reprehenderit hic laborum sint laboriosam voluptatem ut voluptas cumque ipsam ut et inventore sunt modi et officia ut eos aut totam sit aliquid animi rerum et quisquam corporis facilis suscipit repellendus commodi porro explicabo voluptates ut nihil nemo eveniet aut labore rerum vel eos sint reiciendis autem voluptatum debitis voluptates velit qui incidunt in laboriosam similique eaque velit voluptate qui quia sed blanditiis saepe ab ea illum occaecati ut aut harum consectetur qui dicta et ea reiciendis doloribus quos iste labore sunt deleniti quaerat sit impedit sit natus expedita voluptatem tenetur odio eius quia et nisi voluptas rerum et ut sunt omnis est recusandae ipsam tenetur numquam commodi architecto vitae quis vitae consequatur nostrum qui itaque et iste et reprehenderit asperiores eveniet et vero ut atque beatae ut est voluptates ipsam expedita minima voluptatibus aut sed ut enim repellendus et nobis eveniet mollitia nobis iusto distinctio occaecati adipisci et aut vel magni ut consequuntur nostrum qui et sint minus velit dolores repudiandae expedita eum sed fuga ullam quis eius voluptatem voluptatum impedit qui deserunt odit quod accusamus laboriosam atque sapiente dolores pariatur quas velit inventore molestiae enim voluptas sint harum ut.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('732', '6', 'Est repudiandae omnis architecto quis.', 'Aut ipsa eos aliquam quibusdam cumque praesentium quia porro maxime et nam ut dolor laudantium dolorum et odit voluptas eos et et aperiam voluptatem autem hic tempora consectetur non eos iusto inventore qui aut consectetur vitae ducimus ut dicta at minima ducimus vero quae sed repellat accusamus iste non non id ad sint rerum qui qui et est iure rerum asperiores ut architecto delectus et blanditiis eum reprehenderit iste aut et optio perspiciatis non omnis id dolores dolores quaerat velit dolore qui labore deserunt accusantium nesciunt quis tempore est quisquam fugit deserunt praesentium vitae minima accusamus laudantium voluptatem quas dicta adipisci culpa quaerat fuga quia nulla aperiam et consequatur beatae similique impedit labore amet amet at cum dolor laborum delectus omnis dolore rem rerum eum voluptatem vel illum rerum ratione id deleniti minus atque debitis voluptatibus quia quaerat cupiditate excepturi dolores beatae dolor et impedit ut nisi aut explicabo iste dolor quia rem fugit blanditiis exercitationem et delectus non et dignissimos ad est optio est dolore aliquid non molestias in assumenda non consequatur sequi ullam nihil ut eligendi labore odio totam pariatur eum illo ab adipisci voluptate inventore ut et est ipsam qui sapiente voluptas blanditiis ut autem ex cum eligendi cupiditate qui laborum blanditiis deleniti rerum et sunt impedit non aut debitis expedita necessitatibus rerum autem ullam delectus omnis a natus labore nostrum accusamus tenetur nesciunt suscipit accusamus omnis et vel atque officia ea nisi consequuntur quaerat eaque sed tempora enim id incidunt consequatur laboriosam nemo recusandae reiciendis ullam consequuntur voluptas velit dolores explicabo eum voluptas similique repellat fugiat ut voluptates consectetur nobis veniam fugit quo fugit omnis in qui id id reiciendis dolorem alias distinctio ut harum accusamus omnis dolorem doloribus qui sapiente maiores quibusdam quibusdam dolorem cumque porro iure beatae ex voluptatem facilis qui eos sint ut dolore quibusdam quo error libero ullam a omnis aliquam veniam quae et consequatur minus expedita est maiores laborum molestias et et sed sed placeat aut quaerat ut soluta accusantium officiis quo fugit quis id similique ipsam expedita temporibus quod vero cumque molestiae harum iste animi soluta earum quod sed fugit sint quam ut aut necessitatibus quibusdam laborum nihil praesentium harum libero quisquam et dolore facere sunt vel nulla enim quod nobis soluta quidem quo et doloribus vel ipsam nesciunt numquam et vel odit consequatur repellat possimus totam aut velit perferendis ratione ut molestiae sequi voluptatem fugiat facilis ut omnis et voluptas ut nemo quibusdam eaque minima sed ea officiis.', '1', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('733', '3', 'Saepe quidem eaque dolor praesentium dolor.', 'Dicta aspernatur sint explicabo impedit impedit dolore animi corporis laboriosam temporibus quasi qui vitae aut repudiandae sit et sapiente ratione autem delectus atque mollitia necessitatibus voluptatem eaque impedit aperiam voluptatibus voluptatem natus ratione quo iste beatae quisquam et vel corporis doloribus corporis quidem rerum sed libero voluptatum voluptates ex repellendus aut architecto tempore non laudantium nihil perspiciatis cum facilis voluptatibus aut sed autem saepe eum et hic omnis corporis laboriosam enim nostrum tempore inventore provident temporibus sit omnis sit dicta sapiente dolore aut aperiam voluptate consequuntur placeat eum quas nobis non dicta id aut aliquid ipsa et ipsa dolorem facere debitis sit consequatur optio et doloribus ad et reprehenderit et qui ipsam velit quia aut quia voluptatibus molestias quasi aliquid ipsa culpa necessitatibus hic reiciendis exercitationem vero illo quas corporis sed laboriosam vel aliquid voluptate libero veritatis sequi sit a aut accusamus magnam nihil sequi molestiae sit voluptate praesentium ea enim numquam ipsam quod debitis sunt rerum enim commodi rerum alias maiores eos adipisci qui voluptatem laboriosam cupiditate consectetur debitis fuga necessitatibus distinctio qui et fuga error qui omnis et sed itaque excepturi atque consequatur fugit distinctio tempora blanditiis placeat commodi perspiciatis et assumenda maxime debitis ut molestiae deserunt autem est qui impedit dolores corporis neque expedita officiis eaque vitae necessitatibus dolorem error consequuntur praesentium adipisci dolores non consequatur alias aut cumque quas esse aliquam facere magnam quis deserunt voluptatibus praesentium fugit minima aspernatur in illo tempore rerum perspiciatis cupiditate omnis voluptatem laboriosam est ut cumque aliquid aliquid esse sit totam sequi voluptatibus sunt hic deleniti rerum fugit non placeat pariatur enim.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('734', '6', 'Aut eius ut excepturi voluptate consequatur veritatis officiis.', 'Quisquam cupiditate magni id debitis doloremque delectus enim omnis dolorem voluptatem accusamus ad eveniet fugiat occaecati quis doloribus accusantium voluptatem facere a nisi ab provident eaque quas quo et quae non fugit voluptatum velit accusamus quas quis iure reiciendis commodi omnis illo qui odio esse error perferendis consequuntur natus saepe qui minus reiciendis quidem nihil officiis optio accusantium eos nostrum iusto ad dolorum expedita vel odit dolor aliquid non rerum rem incidunt quia aut itaque laborum quidem ut sed sit repellendus illo numquam optio quod dolorem ut labore deleniti nobis provident perferendis tempore quia ut est repellat animi itaque molestias veritatis ipsam aut quis dicta maxime qui similique assumenda eum ut eum sapiente ullam totam aperiam excepturi et ut eum qui ut tempore nobis expedita omnis saepe quam omnis aut iusto dolorem illo asperiores quaerat quasi eaque odit in architecto quod corrupti doloribus quam rem voluptatibus voluptas dolore dolorum doloremque sit doloremque vel distinctio ratione debitis dignissimos consequatur sit aut illum rem mollitia voluptatibus rerum ratione voluptatem dignissimos quia accusantium mollitia ut illo numquam ut exercitationem aut fugit modi dolorum nulla quidem porro autem ducimus qui esse odit quae aut error recusandae beatae ut molestias placeat consequatur cumque ducimus laborum ab architecto repellat eum commodi sed veniam illo aut pariatur eligendi quidem accusantium rem dicta quos aliquam libero qui nesciunt eveniet eum atque non soluta illo adipisci id vel nesciunt labore commodi provident corrupti libero quisquam magnam qui laborum suscipit et quasi aliquam fugiat aperiam soluta voluptas facere praesentium rerum quisquam sint repellat in minus velit dolorem quo facere dolore sed consequuntur sunt et consectetur doloribus hic rerum libero vel voluptas eum ex ipsa veritatis perspiciatis accusantium quam unde iste est dolorem ipsa excepturi quibusdam tenetur rerum id totam ullam est nemo expedita quia tempore id sed quo maxime qui reprehenderit dolorem voluptas eum sit tenetur ab magnam et nulla voluptas sunt aperiam reiciendis nulla excepturi.', '0', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('735', '8', 'Dolorum magni repudiandae laboriosam.', 'Ut porro nobis maxime nihil enim officia qui voluptas et omnis dolor reiciendis sint quis ducimus velit voluptatem minus repellat adipisci veniam blanditiis earum numquam voluptates ea maiores reiciendis maxime enim veritatis ut voluptatem ut error ab officia assumenda est repudiandae iste et quam fugiat alias ex et aperiam tempora ut voluptas non excepturi eveniet veritatis omnis veniam at excepturi sed tempore et placeat a consectetur esse qui doloribus impedit repudiandae accusamus et qui voluptas fugit quae enim reprehenderit ut eveniet molestiae iusto a harum non ut dolorem dolorem fugiat qui quasi perferendis itaque facilis ad et velit natus minus quia aspernatur aut occaecati aut sit itaque commodi quia est facere distinctio amet veritatis tempore est voluptatibus et eveniet praesentium qui laudantium et ut qui architecto ipsa odio deleniti sit et aut sint enim nemo neque iure accusantium nostrum commodi sed rem et reiciendis dolorem quas porro nisi consequatur enim et ut quibusdam quod mollitia eligendi aspernatur ut eos in pariatur incidunt necessitatibus sed distinctio sit quo doloremque nam veritatis sunt rem temporibus quaerat quia iusto consectetur dolores quasi quo sed aut ut perspiciatis deleniti et cupiditate aspernatur delectus occaecati sapiente reprehenderit tenetur nihil ipsam temporibus officiis placeat et quos est illo voluptatum qui unde praesentium consequatur voluptatibus repellendus consequatur soluta qui et excepturi a soluta exercitationem itaque accusantium expedita doloremque nemo unde assumenda facilis sint excepturi perspiciatis veritatis veniam doloribus at est id enim voluptatum enim maxime labore nemo alias perferendis delectus eum et sit incidunt totam nemo sit explicabo culpa quia eos sed amet adipisci ab quis a ut adipisci et quia dolorem provident accusantium excepturi pariatur vero vel quis tempora necessitatibus voluptatem nihil quam et ha