INSERT INTO `course_news` VALUES ('736', '5', 'Eum esse eligendi in sed aut.', 'Nemo quo voluptatem qui magni eligendi vel qui quia et optio odit accusamus neque corporis hic recusandae ipsa beatae nemo nostrum nostrum ullam atque reprehenderit et consequatur ducimus sapiente perspiciatis nesciunt voluptates debitis praesentium cumque sunt enim libero amet suscipit ratione rerum et voluptatibus ea labore eos omnis id quas at iure aliquam eveniet consequatur iste aut enim natus non et eveniet est dolor mollitia harum dolorem blanditiis ut explicabo odit quod quod commodi quam atque velit quos consectetur veniam repellat necessitatibus molestiae ut beatae nostrum itaque et qui et dolorem dolor consequatur distinctio incidunt dolores quae explicabo nihil eveniet explicabo quasi dolor facilis ipsum non numquam enim libero omnis consequatur dolorum quam possimus et velit fuga aut nihil vitae omnis iure quia quia eos nostrum quos veritatis quia voluptatem quibusdam corrupti sint consectetur aut hic aut odio impedit assumenda impedit tenetur eaque aut sint vel recusandae et ut nihil ducimus eos et sint laborum sed itaque quo repudiandae ad fugit quia quisquam nihil vitae ad est assumenda eius ea et accusamus nihil praesentium modi debitis quis numquam ullam aut et eum non voluptas velit non cumque eveniet id nesciunt harum temporibus incidunt consequatur unde impedit earum veritatis molestias pariatur qui sit inventore ipsam asperiores sit est molestiae culpa sunt earum quisquam fuga ipsam quaerat cupiditate rerum perspiciatis fugiat nam non est officia occaecati et consequatur sunt velit voluptas consequatur numquam sit id dignissimos rem quas ea quisquam excepturi perspiciatis doloremque odit est quia aut consequatur voluptatem error fuga et alias deleniti consequatur at possimus natus rerum ipsam fugiat porro distinctio atque ex nobis voluptatem.', '1', '2017-05-02 22:59:27', '2017-05-02 22:59:27');
INSERT INTO `course_news` VALUES ('737', '6', 'Provident eaque quia dolor ad id.', 'Culpa necessitatibus aliquam deleniti nesciunt tempore accusantium quaerat quisquam atque harum non eos iusto molestiae voluptas veniam repellendus numquam cupiditate hic et quia quis recusandae repellendus aspernatur nihil impedit accusamus atque velit rem quam enim ut eaque nihil id molestiae beatae aut dolore officia error a dolores et accusantium totam molestiae possimus placeat voluptas expedita dolores soluta non et sunt rerum assumenda dicta vel recusandae dolore excepturi nostrum ducimus consequatur magnam minus temporibus facilis atque minus et qui omnis et et laudantium temporibus sit id amet cumque odit in fugiat ut animi iusto sed dolor expedita quas aut aut iste iusto architecto earum hic dolorem velit ipsa incidunt animi voluptates sed expedita eligendi eos maiores ex ea est quidem sed et provident dolores tenetur et numquam rerum in rerum quas qui dolores exercitationem quia voluptatem aut necessitatibus quas est eos consequuntur a provident magnam numquam ipsam doloremque qui veniam laudantium velit illo ducimus quos adipisci quis odit cupiditate laudantium quos repellat temporibus laborum aut deleniti ea eos ut pariatur quibusdam non neque est recusandae ullam hic aliquam assumenda voluptas vel et corrupti libero ea officiis sed tempore cumque voluptas enim pariatur hic ipsam deserunt explicabo eius hic voluptates modi nostrum est nobis sunt rerum sit molestiae possimus excepturi sunt quis est iste et sed porro dolores reprehenderit hic molestiae et et autem expedita quos consequatur illo qui dolorum ipsam earum amet praesentium neque corporis in distinctio voluptatem reiciendis alias asperiores sit labore ut quia exercitationem est labore reiciendis ea totam sint voluptates consequatur voluptatem minus magni unde distinctio deserunt perferendis rerum sit mollitia animi beatae officiis adipisci dolores aut amet minima quam ea aut maxime ut aperiam corporis temporibus