INSERT INTO `course_news` VALUES ('738', '4', 'Animi reprehenderit ea aut possimus et.', 'Esse commodi ab nobis qui et voluptatum minus in provident veritatis aperiam sed facilis cumque aspernatur consequatur est in cum quae corrupti quae corrupti ut earum nostrum esse rem voluptas cumque rem neque esse deserunt quae hic voluptate qui ratione veritatis aut in modi sint ratione maiores provident aspernatur minus suscipit exercitationem aliquid corporis recusandae quibusdam autem dignissimos excepturi expedita ut a adipisci rerum autem corrupti doloribus qui sequi corrupti nemo aut nam dolores adipisci et illum omnis veniam illo ut tenetur iure cupiditate necessitatibus iure necessitatibus suscipit expedita repudiandae dolores explicabo nam labore sit placeat temporibus quis occaecati et provident necessitatibus aperiam rerum voluptatem et qui esse quasi molestias nostrum voluptatibus similique consectetur quaerat enim et distinctio facilis sunt aut veniam ut quia quibusdam et ducimus quisquam officiis aut rerum voluptatibus omnis quisquam molestias expedita atque aliquid voluptate debitis enim quas corporis eum placeat dolorem dolorum nihil voluptatem et accusamus incidunt dolorem distinctio numquam quod placeat sed impedit dolor quidem occaecati voluptas voluptatem adipisci ea tempora sequi quo saepe ducimus fugit expedita qui voluptate vel iste commodi rerum sapiente aut quam cum ullam sed veniam voluptates possimus corporis repudiandae eveniet aut ut sint voluptatem architecto sit earum optio labore ut iusto culpa saepe praesentium quo eum voluptas et rerum quibusdam aut atque occaecati quaerat sint accusamus similique tempore dolores iusto enim itaque debitis et iste at rem ut id totam tenetur vero aliquam nisi ipsa est odit qui ullam similique sint cupiditate quia et rerum ea minima repellendus ipsa dolorum expedita quo non quia molestiae veritatis id delectus autem et voluptatem aspernatur magnam repellendus labore molestiae reiciendis dolores dicta cupiditate enim necessitatibus ullam at expedita reprehenderit pariatur ut dolores ut voluptatibus dignissimos quis numquam assumenda ut ut quas doloremque ratione ex ab omnis tempore magnam temporibus placeat fuga impedit repudiandae ut nisi ipsam autem maxime soluta ut at quia libero perferendis qui consequatur vitae doloremque minus expedita aut illum perspiciatis dicta dolores repudiandae sed libero amet a non tempora pariatur reprehenderit voluptas exercitationem est aut aut earum quis necessitatibus magnam et aperiam qui aliquam autem ullam numquam fugiat molestias nam rem laboriosam mollitia alias architecto optio tenetur unde aperiam tempore odit animi dignissimos et reiciendis excepturi dolorum perspiciatis sed consequatur vel ab ullam voluptas itaque id vel ipsam.', '0', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('739', '8', 'Sequi dicta quibusdam impedit animi.', 'Rerum error tenetur ut sunt quia a nostrum qui eaque atque voluptatibus ratione dignissimos error qui odio officia ut qui perspiciatis maxime distinctio quod et accusamus eaque dolores debitis ut eum qui est neque minima ratione ut vel perspiciatis molestiae ipsum commodi tempora amet impedit in ut ipsam et ea optio nobis et vitae atque alias quo et a assumenda necessitatibus alias velit ut qui vitae consequatur eius soluta aut qui nisi nemo magni et sequi aut omnis et et corrupti aut possimus vel repellat dolorem et occaecati exercitationem minus sequi quisquam dolorem impedit optio nulla possimus et ex earum veritatis placeat necessitatibus in voluptatem ab ratione enim qui omnis et fuga alias placeat numquam est cupiditate corporis sint dolorem qui eaque error enim aut amet laudantium ex necessitatibus ex nihil numquam vel doloremque quidem occaecati aut laborum vitae omnis ipsum nam qui officia aliquid dicta in id veniam animi ipsum consectetur iste aut delectus molestiae voluptatem est sit modi eos adipisci similique ut placeat ipsa ducimus et enim facere magni tempora a pariatur tempora sint quasi et sed et velit sit blanditiis et est fugiat id atque qui laborum id et quia dolores quisquam dignissimos eos quis officia praesentium autem excepturi.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('740', '9', 'Incidunt laudantium quidem laborum consequuntur iusto ducimus.', 'Sapiente autem optio cupiditate illum voluptas saepe ut quis minus ut doloribus fuga quod nulla quasi voluptatem magni in explicabo esse explicabo sed et harum omnis maiores est quaerat sit voluptate aliquid totam occaecati sit sunt voluptatem impedit sed quasi accusamus est in et sunt modi nulla quaerat quaerat non sed ut velit adipisci sint delectus numquam neque ut at ratione quis dolor eum voluptatibus officiis aut officia voluptatem possimus omnis est eos est aliquam explicabo sed eos eos fugit modi excepturi aut quis porro qui voluptates voluptatem numquam adipisci hic eveniet error rerum mollitia qui natus dolorum ipsa accusamus est omnis adipisci quia ea et nisi excepturi et vitae nam dolore quas exercitationem quia numquam laborum molestiae vero quia exercitationem quia fugiat modi voluptate consequatur doloribus iusto omnis eaque facilis repellat consectetur et eveniet ex quis minima repudiandae alias non enim nihil est est autem possimus aut explicabo repudiandae sed similique a quia quia et perspiciatis incidunt velit ea aut pariatur sint voluptatem explicabo non tenetur et beatae magnam dolore suscipit at eos at atque expedita ut dolore velit laboriosam eligendi eligendi consectetur eos assumenda nulla vel enim quia molestiae nesciunt ut accusantium earum amet rerum modi similique enim error quia quisquam vel sunt aliquid repudiandae tempore sequi qui quia reiciendis temporibus eos necessitatibus est labore tempora nisi saepe totam officiis eum et et rem ut rerum vitae repellat autem dolores doloremque cum veniam aut quaerat molestiae mollitia neque quia doloremque itaque ipsam laborum beatae voluptatem sint sapiente ut magni voluptas cum laboriosam voluptatem animi consequatur quaerat consequatur architecto et quaerat modi commodi mollitia voluptatem est aut aut inventore atque cupiditate repellat incidunt dolor aut libero quod voluptatem te