INSERT INTO `course_news` VALUES ('741', '1', 'Qui voluptatem molestiae ut et.', 'Reprehenderit vero ut quae architecto nostrum et fuga nihil blanditiis eum mollitia molestiae nostrum est fugit mollitia repudiandae est commodi fugiat deserunt quo dolorem impedit quo doloremque et aut qui consequatur voluptatem est possimus asperiores dolores nihil numquam quia repellat dolore voluptatum enim praesentium ut impedit ut odio eum dolores ad modi in ratione tenetur tempora totam non assumenda sunt in et non laborum quis magnam esse alias accusantium et maxime dolores aut libero dolorem iste vitae magni eum ullam cumque magni culpa fugiat earum fugiat dolor explicabo consectetur qui minima laudantium consequatur laborum assumenda voluptatibus non consequatur sapiente et ut quo non doloribus eligendi vel voluptates esse deleniti sit officiis deleniti voluptas excepturi at magni dolor quidem aut eaque aut ea similique pariatur nisi sit enim nostrum quasi dolores nemo impedit molestiae sit dolorem ducimus est iure temporibus consequatur eum ut rem aut sunt minima reprehenderit vel officiis odio voluptatibus sunt repellendus laboriosam magni porro qui sed ipsa quam recusandae eligendi enim numquam quasi ullam eaque id velit ducimus sed voluptatum iste repellat quia magni rerum minus repellendus voluptatum reiciendis est ullam quia saepe veniam at quas id autem similique enim aut omnis animi sunt non quaerat asperiores explicabo libero eum illum sint culpa quia consectetur qui aut quos et perspiciatis beatae voluptatum blanditiis saepe impedit illum maxime est iure atque illum quis voluptatem impedit nesciunt fugit quis eum porro error quia ut ducimus explicabo ut est architecto enim et repellendus aliquam nulla dolores repudiandae soluta iure deserunt et quo magni quia qui illo laboriosam omnis omnis nihil et expedita id magnam atque rem molestias aut eos et dolor et nam sequi consequatur minus beatae fugiat reiciendis reprehenderit aliquam corrupti a cumque ut id quisquam cu