INSERT INTO `course_news` VALUES ('742', '1', 'Placeat non explicabo dolor voluptas quasi.', 'Qui repellendus odio corporis rem voluptatem reiciendis nisi porro porro ipsa omnis aspernatur saepe sed alias unde omnis ut facilis quam error occaecati nihil laudantium enim maiores aliquam neque assumenda delectus voluptate quasi atque ut expedita quaerat qui minus delectus illum velit nemo et distinctio velit perferendis quidem sint incidunt soluta commodi sed dolore non vel nostrum est ab sint ut rerum qui aspernatur nesciunt illum velit commodi molestiae voluptatem rerum quia similique dolorem ut eligendi non architecto sint eligendi illo omnis est voluptatem quibusdam accusamus et tempora explicabo consequatur vero distinctio iste ut veritatis error nobis rerum qui accusamus non et eos officia similique velit hic id ut vel asperiores et tempore sed atque incidunt et repudiandae qui velit aliquid molestiae ut sunt est dignissimos totam dolor perferendis nihil quia ea facere rerum qui aliquid numquam debitis expedita corporis et et non sapiente rerum et aperiam quo expedita non dolorum quas libero et vero neque et ut aut numquam magnam ducimus inventore ut ut esse eum reiciendis velit non qui maxime et vitae ducimus accusantium saepe voluptatem vero reiciendis dolores rerum corporis ut ut ullam modi sit sequi quaerat officiis non molestiae aut eum nam et aut deleniti iure ut neque ipsum distinctio in voluptate nihil ratione accusantium nisi impedit accusamus dolorem consectetur esse velit aut nulla nam est et aliquid id qui nisi qui explicabo corporis praesentium eum dignissimos adipisci nulla totam voluptatem similique nesciunt rerum vitae consectetur voluptas libero earum commodi numquam et in aut illo odio eius minima consequuntur culpa enim numquam sapiente est sunt dolores vel iure voluptas qui consequuntur incidunt odio quaerat sunt iure qui sapiente ut ut et nihil quis incidunt aut aut fugiat commodi doloremque nihil non porro accusantium et et sint et deserunt explicabo aut cupiditate similique quas beatae non officia fugit est hic repudiandae atque aut provident odio minima doloremque pariatur ea quae ut consequatur possimus ut nobis quam molestiae doloribus dicta iusto quibusdam blanditiis dicta nemo omnis sapiente quasi aut omnis enim iste rerum fugit sit iure quia nemo sunt et est quas facilis ipsa in dolores officia eos laboriosam est et molestiae perspiciatis aliquid sequi maxime eligendi sed dolores assumenda animi sed earum et quos ipsa ut similique accusamus hic et.', '0', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('743', '7', 'Eum qui aut illum esse.', 'Eum libero hic iusto excepturi molestiae mollitia dolores exercitationem aut recusandae saepe saepe molestiae labore veniam nihil fugit non nostrum rerum perspiciatis facere sint praesentium odit corrupti et sunt temporibus sed tenetur eum incidunt perferendis sed non enim placeat est est nam maxime cumque vitae quidem consequatur modi dicta ut sapiente nam totam reiciendis sit hic minima dolore repellat quia ea et recusandae excepturi est eaque libero maxime vitae quidem accusamus qui maxime ea quia quam quam fugiat ad eligendi et omnis quis consequatur perspiciatis inventore laudantium natus tenetur natus enim quia sint reprehenderit nam molestiae deleniti illum consequatur magnam cum in molestias asperiores non sapiente sint est doloremque dolor facilis et cum ea iure non enim deserunt nemo error provident ducimus qui ullam placeat ipsa libero minus illo veritatis quasi neque molestias ea ipsum et ab eos vel et dolores eos nihil et et voluptas atque et qui rerum nulla assumenda eaque pariatur officia deserunt qui commodi facere molestiae ut inventore facere ratione et non quam quod et repellat quia cupiditate amet tempora vel ea aperiam autem facere quo veniam debitis ad omnis dolor ut sit quasi voluptates vero ut est sint sunt asperiores quia enim officiis veritatis non in neque et rerum non vel eos reprehenderit dolore modi dolorum laudantium ipsam quibusdam et voluptatem voluptas nihil molestiae omnis quis voluptas perferendis doloribus repellat sit nesciunt amet recusandae rerum accusantium et hic ad occaecati omnis illum laboriosam adipisci explicabo necessitatibus ut nam saepe enim laudantium beatae ratione aut doloremque aliquam harum accusamus consequatur at ratione ut enim fugiat eaque dolor eos vel tenetur non doloribus ipsum nulla dolorum dignissimos doloremque optio a blanditiis dolorem qui consequatur ut eius accusamus dolorem est molestiae molestias sapiente doloribus nobis de