consectetur pariatur ab dolorum ut quas consectetur libero et vitae sed reprehenderit dolorem officiis facere numquam omnis corrupti.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('745', '5', 'Nihil ut rem est assumenda laborum.', 'Voluptate et nisi quia architecto cum quae omnis repellendus recusandae voluptas ducimus nobis fugit sed sapiente doloremque libero cum molestiae quos laboriosam tempora neque eum porro odio tempora eos debitis similique suscipit impedit sed facere tempore eos commodi quos aut a est laborum debitis esse exercitationem tempora dolores natus voluptatem dolore provident deleniti assumenda eius et vel dolore doloribus dolor nam facere autem a non aut facere et in ut in et possimus impedit optio harum eum eaque animi asperiores reiciendis ab velit minima ut saepe quam pariatur quidem id porro quos enim provident quod et ut et odio aut maiores aspernatur eum impedit saepe qui ratione cumque ut qui enim aperiam voluptas sunt nesciunt qui libero animi incidunt quam eos animi molestias eius sunt ducimus placeat voluptatem cupiditate error sed est beatae ut alias soluta numquam sunt molestiae numquam eius vel vel hic ut corporis dolor praesentium illo consequatur tenetur nam laborum est aperiam qui et recusandae esse deleniti odio dolorem illum fugit ipsa commodi animi ut qui quibusdam qui voluptates aut praesentium iste vero nulla sed necessitatibus ut vel rem ullam perspiciatis in sed facere vel recusandae qui rerum dolorem eligendi iure a ipsum eaque perferendis qui vel mollitia odio optio impedit illo consequuntur praesentium porro non velit dignissimos dolorum deserunt laudantium enim asperiores minima quisquam ea sint consequuntur repellendus blanditiis quos aut molestiae quis ut voluptatem recusandae deleniti iste hic officia omnis dolorum in iste minus omnis qui qui sit tempora maxime est distinctio fuga ut molestiae est ratione animi animi sit sapiente aliquam pariatur corporis blanditiis aut perspiciatis ipsam placeat qui sunt laborum ut atque amet suscipit est voluptate sit quas ipsam amet labore molestiae excepturi voluptates eos consequuntur error perspiciatis cumque sed ut est excepturi voluptas quam illo odit nemo beatae ipsum non officiis quibusdam perferendis officiis in excepturi necessitatibus itaque qui et in quisquam voluptatem nulla velit optio voluptatem occaecati nihil odio enim recusandae rem quo officiis doloremque unde exercitationem dignissimos ut et officiis et qui pariatur et ratione et sequi dolores voluptas repellat dignissimos harum esse aut laboriosam voluptas aut maiores officia iure et optio temporibus dolor voluptatum nulla dolor quas velit harum inventore autem quaerat qui suscipit consequuntur sint alias cum voluptas sed maxime magnam hic possimus eum molestiae ut sed amet repellat veritatis iusto est dolore quisquam praesentium enim unde pariatur qui dolores praesentium qui facere molestias nihil est natus at omnis facere quaerat deleniti sed quibusdam quibusdam neque autem.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('746', '2', 'Quis qui temporibus repudiandae quo nam.', 'Optio reprehenderit laudantium et est voluptatem quia sint soluta ut est excepturi voluptatum voluptatem nulla provident corrupti esse debitis eligendi autem quia cumque quo facilis nobis autem officia nisi ratione voluptatibus reiciendis nihil eligendi et rem dolores perspiciatis iste officia fugiat aut quaerat tempore ut aut at quo impedit provident unde officia magnam provident illo reprehenderit sit vitae quam quia aliquid alias commodi laborum ullam illo ea est a sunt iusto consectetur molestiae vitae qui unde corporis aliquid incidunt repellendus assumenda eum assumenda ut fugiat quia maxime nobis aut dolorem voluptatem tenetur voluptates facilis qui quibusdam quis iusto quos repudiandae quasi et dolorem ullam at asperiores ad veritatis qui laboriosam laudantium dolorum itaque nulla dolor nemo dignissimos praesentium rem fugiat voluptas expedita laboriosam vero dicta tenetur quo veniam amet aliquid quia suscipit non sint voluptatem quia et impedit minus neque inventore maxime corrupti eius voluptas optio consequatur magni voluptatum eaque molestiae beatae quos rerum consequuntur esse exercitationem nobis incidunt voluptas et suscipit dolores minus aliquam voluptates voluptatem repellendus a facilis omnis velit qui accusamus qui non sint aperiam voluptas et mollitia inventore sit est nihil velit architecto est quia recusandae velit nulla qui nihil quia similique itaque accusamus voluptatem corporis illum cupiditate officia est voluptas voluptas omnis suscipit.', '0', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('747', '1', 'Et harum accusamus quis dolor fugit.', 'Et esse similique occaecati est earum expedita quaerat numquam quia hic quis adipisci ex est adipisci eos at est dolorum consectetur quod illo eum voluptatem sapiente molestias quo qui ut consequatur accusantium vel reiciendis officia quia dolor ad sit rerum unde et tenetur molestiae qui expedita accusantium dignissimos sed voluptatem quis modi officiis est libero iure ut rem veritatis necessitatibus nulla esse mollitia quidem voluptatibus quas et voluptatibus ducimus a asperiores ut veritatis vero a velit quod molestiae iusto et ut qui recusandae sint aliquam enim eius voluptatem voluptatum suscipit eius dolores voluptas dolorem molestiae deleniti doloremque fugiat ratione esse facilis est et explicabo exercitationem necessitatibus error voluptatibus aut quia minus aut officiis odit esse unde voluptates explicabo deleniti qui nihil et aut quis nostrum tempora ducimus cupiditate molestiae mollitia qui et sint et placeat ut blanditiis aliquam consequatur error aperiam quis corporis doloribus quisquam fugit est nulla quo officia numquam quia perspiciatis sequi et nihil distinctio quia et veritatis cumque ut voluptates voluptatum in sapiente quia quae et magnam eligendi at incidunt et est ea corrupti tenetur doloribus laudantium rerum accusantium voluptatem velit ea quaerat sint qui sit qui eos enim blanditiis ducimus ipsum nihil occaecati in sed sint expedita aut et qui ratione et est earum et mollitia est id aut quaerat ea ratione hic quis nesciunt occaecati eum laboriosam itaque aliquid neque quas sed asperiores necessitatibus et sunt aut qui id aspernatur quo culpa et quasi et rerum et necessitatibus consequatur quisquam recusandae quia ipsum voluptatibus consequatur qui illum sit ea tempore dolorem.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('748', '3', 'Expedita voluptate quia iure non.', 'Vel a quis atque et laborum iure laboriosam ipsa optio dolores quia modi perferendis eum error praesentium maiores debitis voluptatem reprehenderit libero sapiente voluptates iusto totam placeat temporibus animi vel natus quo earum eum accusamus praesentium illo soluta dolor consequuntur minus esse est similique dolorem rerum aut quidem illo est dolor aut nam eius velit sapiente voluptatem non suscipit culpa eaque explicabo consequatur earum optio quibusdam et minus totam totam sit aut reprehenderit ipsum sunt commodi omnis ratione sint aut voluptatibus reiciendis qui in laboriosam laboriosam in ad vel voluptate aut enim illo harum excepturi voluptas et nemo excepturi iusto consequatur dolorem dolores ut sint aut deleniti tenetur totam reiciendis iure fugiat vel voluptatem et in ab error magni tempora laborum sequi quae enim blanditiis sapiente quaerat ducimus ullam accusantium quam iste distinctio omnis modi similique molestias eius et sed rem itaque qui aliquam est cum aut alias recusandae ex debitis blanditiis consequatur voluptatibus earum aperiam quia natus facere deserunt est dolorem et quis error aperiam et eveniet aliquid eos nobis quia sunt voluptatem perferendis amet tenetur architecto quam sed saepe molestias repellendus iusto sint minus quasi possimus necessitatibus voluptas hic voluptas dolores saepe pariatur qui omnis necessitatibus deserunt deleniti voluptate voluptatem consequatur quo praesentium minima autem quasi nam porro quaerat laborum quis mollitia velit adipisci ex rerum quia atque cumque sint dolores facilis ducimus consequatur.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('749', '3', 'Autem necessitatibus ea qui.', 'Nemo totam placeat quis nesciunt consectetur consequatur inventore veritatis quos labore rerum et quia voluptatem dolorem at blanditiis ut dignissimos ut vel earum animi voluptates aspernatur quia iusto rem voluptatem facilis autem fugit non aspernatur mollitia sint nulla voluptatem exercitationem doloremque eum iusto aut ut accusantium aut sint exercitationem ut cupiditate voluptas et ut sequi eveniet rerum neque ut est neque vel fugiat sed repellendus cumque consectetur doloremque eius quae doloribus nesciunt temporibus incidunt est quibusdam at est reiciendis deserunt omnis non voluptas ut aut repellat ex quae voluptas assumenda quisquam id dolorem sint corporis autem et quibusdam dolor repellendus quia ex quod veritatis ut incidunt officia ducimus unde nisi dolor nam mollitia labore quasi pariatur numquam asperiores dolorem labore autem ad eaque sit veniam et odit necessitatibus quos vero assumenda sunt fuga ipsum voluptatem nesciunt aut veritatis minima omnis exercitationem repellendus delectus consequatur in dolorem repellat corrupti est consectetur omnis ducimus necessitatibus at enim quis est qui sed ducimus ipsam omnis doloribus beatae mollitia eos ut maxime quia et delectus exercitationem quae at ut dolorem deserunt consequatur deleniti omnis earum ea adipisci quos maxime dolore sint autem sint cum temporibus eum possimus accusamus eius et sint explicabo corporis est quae tenetur debitis omnis totam voluptatem ut dolorem autem harum provident veritatis nihil sint assumenda fuga molestiae consequatur voluptas voluptatem et praesentium ipsam qui laborum sequi ullam vel eius soluta voluptas accusamus molestiae dolores dolore cumque reiciendis quas.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('750', '10', 'Illum ut tempore ut ut alias voluptatem.', 'Odit ad nobis et quos velit explicabo dolorem esse sint qui est ea eveniet nam iure doloribus accusamus nam iste dolorem ut et sunt enim impedit dignissimos qui non et accusamus consequatur aliquam incidunt ex possimus natus aut neque tempore perferendis iure enim aut minus suscipit quos aliquid rerum quo molestias voluptatum excepturi excepturi fuga eos enim quos sunt facilis ut enim quia qui voluptate aut dolor eveniet beatae voluptatem nihil nemo perspiciatis dolores labore sed nulla unde dolorum minus libero eius ducimus beatae qui velit est sed corporis quia culpa sequi consequatur voluptas nihil qui non molestias excepturi quo ipsum est excepturi minus aut provident eligendi magnam qui qui distinctio fugit odio aspernatur ut aspernatur ipsum neque tempore sed soluta beatae odit assumenda voluptate qui enim omnis est perferendis atque ipsa sed quia unde eveniet et ea facilis asperiores alias beatae autem rerum qui facere repellat dolores delectus rerum perspiciatis qui voluptatem nobis omnis reprehenderit quisquam et possimus enim praesentium quia corporis molestias quo natus saepe asperiores id consequatur rerum sint amet rem et cupiditate veniam voluptatem accusantium maiores dolor sit dicta consequatur enim sequi et deserunt in ut doloremque provident et debitis officia adipisci quia perferendis et libero enim blanditiis sint velit officia consequatur sed odio nostrum voluptatibus qui sunt sit id odio rerum sed velit recusandae possimus soluta earum a quod voluptas voluptas maiores aliquid qui debitis illo quam quia eos officiis eos qui eligendi dolores odio omnis voluptatem voluptates sed incidunt voluptatem et ad itaque quasi doloremque repudiandae amet rerum doloribus eveniet et quos repellendus voluptas magni suscipit cumque ut et consequatur dolores est excepturi in iste at est est ut quia aliquid ut possimus quasi soluta impedit autem voluptas error aliquam repr