INSERT INTO `course_news` VALUES ('751', '5', 'Minus dolor sit et culpa voluptatem sit ipsam.', 'In nihil autem quia quae veniam ratione sed ea earum perspiciatis consequatur debitis omnis quod velit ut facilis illum velit optio aut magni est et quia perferendis aut molestias qui quidem dolores sint aut et consequatur dignissimos occaecati possimus sint tenetur dicta qui ut voluptas sunt velit repudiandae quia perferendis nobis impedit odit aliquam ipsa qui sit consectetur asperiores esse illo quisquam ut saepe adipisci repellendus consequatur nulla ullam nihil molestiae odit praesentium nulla fuga qui quia id enim delectus possimus corrupti numquam reiciendis et deleniti animi id amet aut dolor ratione nam dolor ut voluptatem id corrupti in officia doloribus itaque possimus id dolore quisquam eligendi delectus et aut rerum sed et non dicta in voluptatem repellat sit tenetur exercitationem odio omnis et quia quibusdam eius alias et totam nobis perspiciatis praesentium repellendus autem laborum illum veniam aut ut quia veniam nesciunt et ipsa praesentium eius adipisci recusandae temporibus et deleniti nobis expedita ducimus sint quos aspernatur quod sint assumenda ut laborum eos libero culpa dolor qui laudantium est deserunt dolor corrupti rerum magnam modi id asperiores ratione sequi vitae temporibus et tempore sint dolore occaecati dicta molestiae alias eaque impedit excepturi aut blanditiis nostrum sunt earum odio rerum eaque illo ullam quidem qui est dolor enim esse et eum et necessitatibus enim assumenda dolor consequatur porro laborum aut sed id et omnis libero similique sint similique ratione occaecati excepturi sed aperiam nihil explicabo accusantium laborum praesentium necessitatibus temporibus odio veritatis sit nostrum sit consectetur quam et tempora voluptas voluptatem eos at maxime enim qui quaerat error qui dolores molestiae soluta culpa porro nesciunt quam quae eos adipisci non aut nesciunt atque sunt quisquam animi necessitatibus inventore optio maxim