INSERT INTO `course_news` VALUES ('752', '4', 'Illo omnis non nihil repellendus porro iure et.', 'Enim repellendus nihil nostrum nihil tenetur sapiente reiciendis qui quae dicta corporis ut tenetur enim ea enim eaque pariatur inventore delectus tempore voluptatum placeat facilis itaque velit architecto ipsum odio dignissimos ex voluptas repellat rem molestiae repudiandae nisi repellendus sunt doloremque velit ut eligendi nostrum odio iste aspernatur animi soluta hic ab cumque numquam est voluptatem debitis et corrupti quod eaque maiores qui blanditiis ea officiis facilis tempore qui rerum omnis unde aspernatur non dolorem ipsum ratione consequuntur molestias in et dicta voluptas sed inventore et ut aliquid itaque reprehenderit voluptatem mollitia quia quas temporibus excepturi veniam quod totam voluptas iure est ipsa autem autem temporibus voluptatum distinctio non tempore ea est odit magni dolorum omnis a voluptatem nihil totam placeat dolores dicta nostrum animi at voluptatem commodi rerum neque et adipisci ad rerum aliquam sit rem est distinctio et labore nihil non qui et ea et exercitationem consequatur et earum qui dolor quasi voluptatum suscipit consequuntur quas velit saepe qui non sint fuga modi porro praesentium debitis eos odio molestiae illo facilis quia similique necessitatibus eos eligendi facilis quas voluptatem impedit veritatis odio corporis aut ut consequuntur fugit veniam perspiciatis rerum dolor et hic laudantium quos officia eius ea rerum omnis et et et maxime quo in sint qui sequi omnis eius sint itaque accusamus eligendi corporis repudiandae maiores voluptas dolorum voluptatem rerum quas tenetur totam consequuntur dolor velit est sed rerum quam natus quia nihil velit quia aut eveniet et fugiat tempore sint rerum sapiente laborum odio eos molestiae reprehenderit dignissimos sunt odit officia est aperiam itaque ratione et veritatis hic rerum ratione distinctio voluptates perspiciatis aperiam exercitationem vel voluptatem rem aspernatur in dolores