INSERT INTO `course_news` VALUES ('753', '5', 'Reiciendis officia accusantium dolore esse.', 'Quae et ex dolorum et omnis animi assumenda fugit quae quis veniam a et et ipsa nostrum id optio est fugiat fugit velit tenetur dolor recusandae et enim itaque nisi explicabo eius pariatur et nihil rem voluptatum corrupti maxime molestiae quis est illum maiores iure explicabo voluptatem accusamus perspiciatis sunt similique rerum quis molestiae omnis est cupiditate assumenda distinctio cumque soluta est temporibus earum fugit numquam quibusdam eos ut veniam culpa delectus a voluptas autem dolores porro repellat ab fuga rerum nobis tempore saepe voluptatem quo non repellendus rerum ut facere accusamus sed est blanditiis qui unde vero quisquam qui quaerat quo ut voluptatibus harum nihil sint quia non nulla labore cupiditate pariatur sint quia vel vel libero amet quo accusantium velit voluptatibus est magnam aperiam facilis corporis culpa molestiae nesciunt harum voluptatem et et hic dolores ipsum voluptatum quia voluptas omnis aut aperiam dolore ab aut nobis nemo fugiat qui non qui eos sed voluptates magnam qui sapiente architecto sunt quia nostrum doloremque facilis officia quia velit et voluptate laudantium quia labore reprehenderit sunt quos ut blanditiis rerum dicta sint at laudantium est expedita omnis impedit impedit quam sunt occaecati eum reprehenderit est vitae natus reprehenderit accusamus ut possimus autem commodi ea id omnis.', '1', '2017-05-02 22:59:28', '2017-05-02 22:59:28');
INSERT INTO `course_news` VALUES ('754', '1', 'Eaque aliquam enim quas molestiae sequi hic quo.', 'Et id sint doloribus molestiae enim unde est aliquam eum enim consequatur qui enim doloremque et nisi consequatur qui officiis omnis fuga deserunt quis et libero voluptatem hic sapiente est ratione et quo doloribus et ullam provident adipisci voluptates quae esse sit iusto consequatur dolorum quis aut maxime accusamus nostrum iusto eos est cupiditate consequatur unde ratione labore quasi incidunt ut sequi molestiae repudiandae qui dolorem est corporis unde nam expedita eligendi fuga culpa id adipisci id voluptatibus ducimus inventore temporibus porro dolore illum sint temporibus laboriosam sapiente error quia sint voluptas minima eum voluptatem illum et distinctio odit voluptatem inventore qui similique commodi dolorem debitis consequuntur fugit tempore repellat molestias magnam dicta a similique dolor aut vel rerum eum quae aspernatur voluptas dolor quibusdam id in fugit dicta sint ut dolores corporis voluptatem est temporibus consequatur dolorem quia magni nam recusandae necessitatibus non sit molestiae dolore voluptas voluptatibus provident reiciendis optio sed dolorem velit est omnis inventore reiciendis ut praesentium deserunt repudiandae minima magnam quas velit dolorem suscipit magni saepe non culpa quos laborum eligendi impedit accusantium laboriosam inventore molestias vero quis officiis qui eligendi qui aut neque est est quos hic accusantium tenetur cum quia voluptas est et odio eos eligendi accusantium sed cupiditate aspernatur vitae ut voluptatum necessitatibus asperiores et qui.', '1', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('755', '3', 'Ducimus temporibus porro saepe vitae temporibus.', 'Voluptatum optio error culpa ut quidem nobis laborum aspernatur aut repudiandae et error veritatis voluptatibus recusandae perspiciatis aliquam cumque incidunt sit vero sequi assumenda neque quo sapiente beatae vitae libero in saepe sunt corporis ullam illum illo ut ipsum excepturi porro ipsa deserunt numquam consequatur voluptas molestias fugit mollitia reprehenderit sit et quo voluptas quae et veniam quaerat aspernatur accusantium laudantium rerum voluptatem enim voluptas nisi exercitationem ea in laudantium in fugiat eum quibusdam quae qui ipsum quis laboriosam magnam dolores quisquam cumque ipsa minima illum esse provident cupiditate omnis et nesciunt placeat eius magnam totam id et ex nostrum voluptas autem illum aut quasi ex eveniet atque temporibus distinctio maxime ad vitae sit soluta eligendi necessitatibus minus explicabo mollitia assumenda aspernatur molestiae quis nihil qui dolorum nihil autem sit voluptatem quia sequi quo explicabo voluptatem minima porro veritatis corrupti et aut doloribus totam voluptatibus dolor tempora dignissimos cum nam non ab aut illo officia rerum quo eum necessitatibus id quisquam quis non voluptas earum consequatur distinctio facere odio voluptatem vitae neque aut consequatur dignissimos quia est aut placeat dolores perferendis eaque suscipit eum iusto et voluptas officiis animi delectus quae laudantium aliquid aperiam animi corporis voluptatibus qui quidem eveniet sed sint ut voluptas placeat quia totam aut minus illum quia eum sint sed eveniet iusto reprehenderit temporibus sint similique reprehenderit quaerat nobis aliquid quia in quo animi eaque eos voluptatem consequatur dolores recusandae eum debitis mollitia et quo quia iure placeat quisquam sit quas dolores quis provident in quasi aut velit eligendi ab ad eveniet provident laboriosam culpa aliquid cupiditate quia aliquam consequatur qui dolor explicabo exercitationem tempore tempore eaque rerum deserunt nihil reprehenderit ut tempora libero nihil enim dolore et accusantium dolor tempora inventore nulla magnam doloribus velit voluptas sed pariatur id in deserunt iusto id dolore ad ipsa eaque placeat quaerat reiciendis quia et consequatur ex ad quibusdam itaque qui culpa perspiciatis ipsum cumque et deleniti adipisci sint quia quisquam autem ea unde fugit rerum et deleniti dolore sunt autem repudiandae quasi porro accusantium necessitatibus vero magnam est est aut ab sequi magni vel et est reiciendis id provident eum ab reiciendis nisi possimus odit qui officiis ducimus ipsum fuga officia neque quia consectetur voluptatem odio sunt molestiae provident quia quia quia molestias veniam ipsum accusantium minus rerum officiis voluptatem beatae eum temporibus aut laboriosam molestiae quia quas ex nostrum rerum quis minima consequuntur.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('756', '7', 'Neque quia sunt libero.', 'Debitis laudantium quia assumenda ut eligendi nulla repellat repudiandae at porro veritatis in et esse qui doloribus dolorem laudantium praesentium dolorem earum id deleniti pariatur ab non ipsum dolores cumque et consequatur illo vitae dicta non quos sunt repellat aliquid consectetur in nisi magni dolores repellat repellendus veniam perferendis iste dolorem nulla dicta ea debitis odio et eaque sit explicabo omnis quo perferendis non labore soluta tenetur molestiae ut itaque quia exercitationem et ad amet expedita repellat eos minima aut recusandae qui et recusandae ea dolor tempora ratione deleniti consequatur veritatis aut culpa aperiam ut dolores cupiditate placeat tempora sint eveniet culpa ipsum qui earum rerum aut dolore sit eos qui voluptatem aut eos dolores consequatur dignissimos rerum et sed eveniet saepe animi voluptatem inventore consequatur qui non consequatur voluptates voluptatum autem fuga quis qui vel earum voluptas numquam aut harum nesciunt non voluptas iste eius deserunt eius reprehenderit exercitationem blanditiis quae rerum in omnis et eveniet qui et beatae earum ex autem cupiditate cupiditate repudiandae id aut molestias eaque in consequatur repudiandae sapiente qui et vero veniam necessitatibus consequatur sapiente et rerum consequatur ut sed ipsa qui voluptas fuga expedita at cumque eius doloremque eveniet aut dolorem consequuntur sequi non tenetur ipsam in omnis facere impedit est optio sapiente enim ullam laudantium qui ullam reiciendis eaque ipsa consequuntur voluptatem voluptatem dolores sunt voluptas sed animi eaque laboriosam velit sed voluptas quis quo voluptatibus dolor est aut quod cumque ut magni aspernatur quo omnis qui delectus molestiae laborum esse ad et cum cumque dolores nulla sit consequatur officiis modi consequuntur illo maiores voluptas quia in molestiae laboriosam similique quibusdam repudiandae dolorum voluptatibus ut aut blanditiis et ut corporis quia dolores aut autem inventore aliquid placeat non aut nulla eligendi iure dolores vel dolor dolores nihil consequatur ut soluta animi doloribus voluptatem et cumque doloribus veniam blanditiis et voluptatem aut porro odit est minima possimus ab magni facere non ducimus autem aut quas animi nulla porro qui provident nihil nemo quia voluptas est omnis exercitationem est ut sed odit sit corporis aliquam nam in modi dolorum ducimus aut qui quod quis mollitia aliquid nobis pariatur ut atque voluptas beatae non aut delectus et asperiores exercitationem et sit facere temporibus excepturi quasi quia possimus earum dolor et nulla dolor excepturi ut nulla sint et tempore nisi cum nihil molestias corporis id commodi laborum ipsa eaque id suscipit ex repellat inventore molestiae adipisci tempore voluptate eius in ducimus voluptatem excepturi accusamus velit et sint architecto et soluta inventore nisi voluptatem saepe.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('757', '2', 'Magni autem ad voluptas debitis quo consequuntur.', 'Vel corrupti tenetur in dolor laboriosam qui natus quae repudiandae et sint labore cupiditate rerum sit esse quis accusamus fugit molestias nihil omnis unde incidunt saepe ducimus tenetur atque eaque asperiores nesciunt et delectus expedita doloremque quo ratione aut et et expedita eos aliquam voluptas hic ut dicta velit assumenda mollitia non iusto accusamus ullam autem quia qui voluptates quasi molestiae suscipit et ratione velit officiis quasi dolores tempore ut dicta nostrum quasi laborum voluptatum recusandae laudantium necessitatibus eligendi magni voluptates culpa quasi sed ipsum temporibus vel quos facere dolorum dolores sunt aut quis facilis ratione esse amet adipisci earum magni eligendi beatae tempore et amet pariatur enim expedita tempora accusantium ullam et perferendis sint molestiae delectus sunt labore sunt enim itaque quia animi aut sint inventore atque sit culpa sit consequatur soluta qui odit est non ratione eum debitis repellat iusto rem dolor pariatur autem dolor ipsum vero illum repellat enim reiciendis odit modi sit vel perspiciatis sint pariatur vel dolorem non et cupiditate architecto ratione qui expedita ut ipsa dolore et eos aut culpa et nam eum omnis rerum et et omnis eligendi ut dolore necessitatibus fugiat qui non eaque sunt nulla ut autem omnis est ratione eveniet non eos saepe aliquam molestiae facere facilis blanditiis quam nihil quos occaecati vel esse perferendis cumque et voluptatem quam magni ut dignissimos laborum officia esse placeat.', '1', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('758', '7', 'Ex magnam vel consequuntur aut reiciendis.', 'Ratione nesciunt pariatur ea eum quidem similique repudiandae numquam ut deserunt quaerat necessitatibus ex voluptas voluptatem repellendus tempora officia hic voluptate atque et maxime inventore in unde aut rerum eos veritatis unde odio dolores aliquam et iure quia dolores sit doloremque quaerat sint et voluptas dolor et vel commodi enim voluptates et occaecati excepturi architecto suscipit repellendus veritatis blanditiis nihil saepe et deleniti tenetur qui et nemo tempora dolorem vero optio tenetur accusantium possimus autem numquam in mollitia doloremque odio error officiis inventore eveniet impedit et quo aperiam qui fugit nisi possimus facilis autem dolores quis accusamus recusandae est illum est sunt doloremque veniam eligendi omnis corrupti corrupti commodi aut illo quo tempore illo voluptatibus nobis culpa et sunt odit sed enim odio dolorem est in quo placeat perspiciatis at perferendis in ut reprehenderit deleniti architecto voluptatibus rem perferendis reiciendis blanditiis perspiciatis qui dolor exercitationem dolorem doloribus consequuntur error impedit ex velit non error tempore consequatur optio dolores aut itaque numquam nam perspiciatis cum tenetur ut facere eos dolor odit amet ipsam consequatur id voluptas quas temporibus ut veritatis autem facilis quia amet nostrum nihil est perferendis non impedit nihil quas sit autem eum nemo reprehenderit unde accusantium sit perferendis praesentium nisi blanditiis voluptatem ut inventore aliquam veritatis earum velit quos consequuntur omnis quam amet consectetur in eius similique voluptatibus voluptate excepturi qui laborum omnis laboriosam et id voluptatibus et illo et magnam et temporibus autem cupiditate et sit aut consequatur voluptate voluptas velit veniam voluptate sapiente vel pariatur porro quae nam ipsam iusto quae sit at omnis fugiat eveniet aut suscipit quia tempora nulla id id est delectus minus vitae alias