INSERT INTO `course_news` VALUES ('759', '8', 'Adipisci ut iusto quia ipsam quo.', 'Deleniti id dolorem soluta voluptas consectetur ab quo et voluptas asperiores ipsum porro reprehenderit vitae magni excepturi unde repellendus tenetur rerum ut id laudantium quidem et ea tempore et totam optio repudiandae mollitia ut commodi tenetur sunt exercitationem consectetur tenetur sunt laboriosam aut enim et sit qui eum dicta commodi facilis odit blanditiis voluptatem cupiditate eum velit distinctio sunt soluta deserunt aliquam suscipit architecto et sit culpa sit et qui expedita modi dolores totam iste sit iure natus eveniet assumenda fuga dicta sapiente dolore aliquam eos ad cupiditate occaecati ut consequatur qui ab dolores fuga quidem ullam atque sit earum repellendus odio libero magnam sed est asperiores officia blanditiis culpa ipsa qui iusto et eos incidunt qui quis molestiae cupiditate et iste eius eum culpa aspernatur accusamus ut enim sed autem et libero ullam hic aut labore aut vel exercitationem dolor tenetur labore tenetur sed quaerat atque voluptatem temporibus voluptatum qui cum dolorem consectetur inventore modi eveniet et et voluptates aut nisi quasi rerum aut ipsa qui aperiam commodi et ad temporibus deleniti delectus eius sequi quia impedit sed aut et quis quibusdam officiis natus laborum non corrupti est sit et assumenda ducimus sint assumenda et est nostrum omnis distinctio tempore id eligendi omnis aut at tempora ut illo iste facere dolore cupiditate quasi vero laudantium eos aut neque provident delectus blanditiis animi delectus ullam est expedita nostrum tempora eos iste doloremque blanditiis quia est culpa ut quibusdam explicabo voluptas quisquam dolores aspernatur quaerat quaerat minima vero non impedit voluptates sed excepturi quae eum vitae nemo quia incidunt culpa omnis ad laborum provident dicta laboriosam dignissimos aut debitis aspernatur et ipsa ut non est fugit maxime unde beatae natus maiores consequuntur commodi minus aut praesentium conseq