INSERT INTO `course_news` VALUES ('760', '6', 'Vitae commodi vel tempora eos doloremque fugiat dignissimos.', 'Placeat ipsa voluptas quis nobis velit officiis vero consectetur sed explicabo magni error et ullam accusamus deleniti non magnam nulla et repudiandae sapiente adipisci quo ipsum labore id eos aliquid voluptate consequatur soluta in tempora quidem beatae mollitia ea sunt dicta voluptate sit quo exercitationem et accusamus explicabo vel harum ipsum molestias inventore dolores neque animi doloribus officia velit rerum est non enim amet qui omnis facilis magnam aut vitae nostrum rem voluptatem suscipit sint dolores autem non necessitatibus dolorum incidunt vel architecto sed debitis iure occaecati aliquid ea quia reprehenderit eligendi sunt necessitatibus aliquid ut sit amet ad repellat consequatur voluptatem corporis eos cum debitis ut minima necessitatibus eligendi natus rem quia aliquam facilis exercitationem saepe sequi veniam et et est corporis rerum nisi velit quod enim ex facilis et blanditiis sint architecto laboriosam sequi nihil exercitationem aperiam quia nemo soluta officiis inventore laborum error accusamus aliquid iste omnis maxime ipsum eum eum dolor fuga et sunt commodi error debitis aut fugit sit labore nihil rem saepe tempora quis sunt molestiae dolor aut similique incidunt sunt iste ea distinctio unde quis consequatur culpa exercitationem sit quos nemo ipsam inventore laborum eum earum iusto nesciunt aperiam eos minima quo sit dolores laboriosam tempore consequatur vel omnis id delectus harum soluta eius magnam eligendi et minus corporis et quidem et aut distinctio accusamus omnis nesciunt quis et distinctio aut facilis temporibus aperiam ut voluptates laboriosam praesentium consequatur qui dolorum corporis porro rem voluptatem non ut ullam consectetur itaque aperiam similique optio eos iusto et enim et reprehenderit nemo id ut non omnis distinctio cumque culpa consequatur occaecati ratione modi ratione sunt blanditiis sint inventore sit totam dolorem corrupti nostrum at eos sapiente quia eum tempore et rerum quisquam suscipit similique dolores quos et commodi distinctio sit et nihil facilis nostrum nobis qui accusamus doloremque molestiae aut corporis velit fuga ipsum consequatur quis corrupti cum labore quam ut voluptas sunt et.', '1', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('761', '6', 'Magnam dolor id hic ut ipsa.', 'Temporibus neque eos nostrum eligendi voluptate vel quos cum sunt quia odit eos voluptatibus ipsa minima distinctio veritatis dolores est qui quibusdam praesentium libero sint animi officia earum in perspiciatis mollitia rem iusto voluptate voluptas aut accusamus quas similique est eveniet rerum est quibusdam ut consectetur veritatis dolorum autem blanditiis ut esse corporis exercitationem harum culpa quis suscipit velit quod necessitatibus rem reiciendis deserunt quibusdam quisquam non fugit et consectetur fugiat natus ullam non distinctio libero quam vero ut ut voluptate deleniti ea deleniti eos doloremque et laborum est quia facere mollitia hic dicta nulla necessitatibus corporis aut optio eum assumenda sed dolor nisi est laborum enim architecto reiciendis rerum rerum minima distinctio commodi optio et officiis sed asperiores enim quibusdam vitae rem voluptas incidunt voluptatem aperiam deleniti veniam et distinctio excepturi voluptas quo accusamus provident ea aut facere pariatur quis est architecto provident quia eaque non placeat non id rem itaque id nesciunt consectetur sed et consequatur animi nihil magni reprehenderit eum doloremque non aperiam ut iure quo debitis esse voluptas nostrum officia necessitatibus sint consectetur in voluptate expedita provident non doloribus eum delectus voluptatem in ratione et qui id non voluptas est ex magni vitae modi officia nisi aut deleniti molestiae reprehenderit quam ut enim enim nobis facilis doloribus et ut beatae expedita in aut est nihil qui nobis autem blanditiis ea laudantium laudantium aut a enim illum delectus necessitatibus vel doloremque alias atque nemo impedit voluptatibus sunt nobis incidunt voluptatibus et aperiam aut minima nisi consequatur odio reprehenderit deserunt asperiores minus ab et voluptatibus eos velit aut quas veritatis ipsam molestiae nobis maiores debitis porro expedita ea qui temporibus tenetur sunt odio expedita et eum itaque nihil cum natus esse consequatur reiciendis a molestiae nesciunt sunt aut adipisci nostrum voluptas minima ea ab assumenda saepe aliquam eligendi et tempore non et ducimus incidunt aut harum illo quaerat repellat distinctio qui voluptatem autem quo illum voluptas laborum alias dignissimos sint odit ut consequuntur illo deserunt quis iure ullam quia ipsa voluptate dolores cum sunt sit consectetur cupiditate atque sed dolorem molestias sit et sit in nam rerum ipsum sit beatae quia cupiditate voluptatem voluptatem quo accusantium id amet officia natus sit corporis incidunt est autem repellendus aut et perspiciatis veniam debitis accusantium rerum nulla culpa et vel nihil placeat qui quo dolor aut.', '1', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('762', '1', 'Fugiat a rerum architecto labore inventore vel.', 'Quis voluptatem magni velit animi illo eum voluptatem accusamus commodi sed consequatur excepturi corrupti nam suscipit corrupti et illo officia odit voluptas in quasi itaque nostrum non rerum labore quasi sint ut placeat maxime culpa delectus placeat commodi ipsa voluptatum est voluptate eum ipsa commodi quibusdam quia provident eum qui officiis voluptatem tempore est delectus dicta unde velit est quo totam voluptatem aliquid nihil eligendi nesciunt inventore veniam aspernatur vel ab molestias tempore dolore possimus distinctio ducimus eius quam ad vel eveniet aspernatur esse asperiores ipsa et sed sit quod adipisci non assumenda minus aut distinctio et et sunt iure nemo modi at nulla ipsum et omnis commodi officia unde sed expedita et laborum rerum numquam sed ratione labore non nostrum aut eveniet sunt quibusdam ut provident nulla ullam nulla labore iusto expedita eligendi corporis deserunt consequatur nulla non ullam earum cumque perferendis optio rem qui nihil voluptatem officiis molestiae tenetur modi quis est molestias ea eius neque ea magnam dolor possimus illum iste labore aspernatur dicta earum quisquam esse voluptatem est vel voluptatem itaque perferendis non quod quia maxime quasi voluptatem laboriosam dolor modi quam consequatur voluptatem ut est occaecati quaerat reiciendis reiciendis sit nemo asperiores beatae quod odit animi nihil non corporis dolorem qui debitis eius qui quasi veniam quia deserunt cum hic fugiat quis aliquam aut velit sit nisi ex voluptas maiores inventore nulla voluptas nihil nam quam quod quibusdam sed autem quia ratione et sunt tempora corrupti a error nesciunt explicabo repudiandae id voluptate vero accusamus dolorem at aut.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('763', '3', 'Dolor facere ipsam quia eum occaecati illum vero similique.', 'Minima atque quas recusandae aut nihil optio rerum sed ea reprehenderit inventore omnis exercitationem ea voluptatem qui excepturi rerum esse corporis enim at sunt sed et aut ea qui aut aspernatur ut rerum quas laboriosam laboriosam libero consequatur magni in autem omnis beatae est tenetur delectus non est autem sint ipsam veniam porro suscipit molestiae quos libero sint sint quis laudantium in repellat voluptate aliquid delectus quidem saepe voluptates aliquid placeat iste dignissimos aut aut distinctio dolor officia aspernatur quia repudiandae iure nam beatae esse labore itaque doloremque doloribus quo nobis vel ipsam sapiente explicabo et ut totam quae occaecati a assumenda quam iure necessitatibus amet eveniet sunt ex sequi repellat et praesentium cum harum iste nesciunt ea in nemo aut sed doloribus qui adipisci autem eum eum nulla optio ea consequatur sunt mollitia rem dolorem aspernatur sapiente dolorem itaque veritatis inventore tempore libero sunt atque vitae sint eum doloribus blanditiis non sunt cupiditate nihil nisi id reiciendis assumenda non architecto error quia et nihil iste dolorem sit asperiores sint iusto officiis minima odit ut architecto dignissimos reiciendis quia vitae voluptatum qui voluptatem mollitia dolore non aliquid tempore ab laudantium sint quaerat et fugiat quod quia quisquam nam eos voluptate quam natus ut enim veniam adipisci impedit sint tempore voluptatem ipsa quo exercitationem et ea aut praesentium minima nulla eaque eveniet recusandae et voluptatem sequi iusto sapiente est ratione aliquid perferendis voluptas voluptatibus recusandae non sed sunt consequatur ab officia excepturi quos qui ipsa soluta perspiciatis libero qui aut eius id inventore a molestiae eligendi nam assumenda voluptas quibusdam omnis aut quo hic iusto reiciendis.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('764', '8', 'Cupiditate animi veritatis nulla.', 'Id quis amet rerum praesentium et dolorem aperiam omnis doloribus eos culpa hic vitae quasi necessitatibus in est est id ex reprehenderit eum minima quis nisi distinctio dolorum nemo doloremque minus veniam minima ea iste cumque maiores ea ullam iure dolor tempora cumque libero enim odit odit dolorum possimus magni tempora molestiae et sit ad enim cum sapiente perspiciatis velit sapiente nemo voluptatem quia porro aut debitis modi iure id tenetur excepturi repellat ut illo saepe quaerat quaerat quo dolores sequi sit provident adipisci debitis voluptas quia culpa officiis repudiandae et ea qui rerum ut deleniti aliquid sed rerum qui est quia voluptates sunt quisquam ut porro quibusdam non sit qui voluptatem quidem et amet qui qui libero voluptatem asperiores ratione ducimus animi non eaque veritatis ut corporis est autem nam nesciunt eum voluptatem et voluptas atque architecto aut aut dolorem labore in ea qui molestiae dolorum dolorum dolorum sint in veniam sit sapiente amet exercitationem quia id ut ut qui ut occaecati velit voluptatum consequatur et at in veritatis earum ipsa molestias hic illo nobis minima quidem ab tempora minus.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('765', '7', 'Corrupti dolorem minima quia molestiae dicta.', 'Harum eaque veritatis quia ab non fuga deleniti beatae fugit sint autem nihil quaerat iusto est nostrum voluptates perferendis omnis qui laudantium magnam est quisquam ex magni fugit quis aut sunt modi maxime et beatae occaecati tenetur voluptatibus sapiente et earum repellendus nulla optio unde mollitia deserunt nostrum eos soluta neque iure placeat eos doloribus ea veritatis quo deserunt autem ea quis ut quis sapiente earum omnis neque autem ad commodi perspiciatis qui optio sit quia reiciendis quos necessitatibus occaecati expedita autem illo non possimus et veniam facilis voluptatem quae quo sunt aut sit qui autem ut qui eius harum qui autem in quia modi debitis et consequatur minus doloremque officia sapiente est aut et sed quia officiis id praesentium quisquam quis suscipit voluptatum dolorem consequatur aut ipsum ipsum quis quam ab tenetur qui et commodi mollitia ut ullam placeat culpa eum expedita rerum numquam veniam voluptas porro et excepturi modi modi saepe odit rem sequi error aut iste veniam eum deleniti voluptatem quibusdam quia nesciunt autem ullam cupiditate quas debitis occaecati totam est modi quia labore et temporibus ab quidem neque necessitatibus facere numquam ut et voluptatum corporis aut ut iure totam velit animi deserunt eum quasi accusamus sequi et ipsum voluptatibus saepe praesentium ad labore temporibus nesciunt neque voluptates voluptatibus ipsa quam reprehenderit consequatur alias perferendis odit sed pariatur sed sed.', '1', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('766', '5', 'Voluptas eos ut odio necessitatibus eligendi quod ab.', 'Perferendis pariatur omnis earum et deleniti adipisci quod optio autem consequatur error qui iste officiis voluptates sed laudantium quam dolores dolor laboriosam quia doloribus illum minus omnis sunt facere voluptate possimus architecto corporis eum sit iusto qui quaerat dolor non enim omnis sed voluptas rerum et est dicta maxime impedit quos illum sapiente voluptatem magnam quas sint non odio quas vero alias numquam asperiores fuga tenetur sint earum tenetur non reprehenderit cupiditate provident dolor deserunt expedita et veniam iure earum rem nisi sit aut sint voluptate at porro facilis ut hic est sit distinctio expedita voluptate possimus repellendus facere nulla quia debitis magnam totam ab nulla maxime officia illum est tempore tempore sed quam similique neque voluptatem nisi autem amet voluptas aut velit doloremque illo facere quaerat facere quidem iste ut atque aperiam vel voluptas qui omnis dolores libero repellendus eos soluta laborum ut earum laboriosam ad architecto ex quia est necessitatibus aspernatur laborum minima debitis voluptatem dicta aut architecto impedit fuga temporibus esse quaerat atque omnis dolores molestias occaecati quae nesciunt similique facere aut eveniet quo quasi officia omnis ut modi omnis omnis explicabo autem accusantium impedit dolore illum doloribus soluta illo assumenda non excepturi est facere esse nostrum quam ipsa accusamus explicabo rerum veniam numquam omnis error rerum adipisci sit distinctio et delectus incidunt vel iusto sequi rem in laudantium omnis voluptas a quas modi dolores harum sit adipisci voluptas fuga laudantium autem.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('767', '6', 'Quos facere iure iusto ex officiis facilis dolor consequuntur.', 'Et aliquam occaecati omnis dignissimos culpa repellat dolore placeat sunt ipsam distinctio rerum ut quasi quisquam ut veniam et alias dicta officia laboriosam debitis molestiae occaecati harum pariatur quaerat quia rerum qui ut tempore accusamus eligendi accusamus in placeat et dolores asperiores voluptas labore sapiente aut rerum nostrum temporibus rem eligendi ut quia ut praesentium sit ipsum aut natus veritatis illo eos quae est totam quos assumenda aut soluta laudantium tempore est voluptates quia rerum et facilis repudiandae hic recusandae quis provident et in fugit sit et ullam excepturi hic et qui quaerat velit asperiores iure non deleniti possimus quibusdam inventore qui voluptatem amet dolorem porro at rerum in qui molestiae nemo et sapiente in minima aut tempore et omnis sed hic repellendus harum tenetur vero hic soluta distinctio deleniti ea nihil porro nemo accusantium mollitia esse tempore voluptatem fugiat voluptate maxime voluptas vero aliquid rerum nihil placeat incidunt alias temporibus exercitationem voluptatibus ipsa est consectetur inventore et qui quae quia est consectetur numquam quo tenetur quam quis corrupti non molestiae ut consectetur aspernatur ullam in voluptatem et dignissimos qui praesentium itaque adipisci sint molestiae facilis occaecati doloribus fugiat est explicabo dolore sed cupiditate eligendi ex beatae animi dolores voluptatem omnis consequatur consequatur ea placeat et explicabo aspernatur aut quia suscipit similique recusandae mollitia similique natus vero dolor unde doloremque voluptatem voluptas sit illo ipsam eum unde nulla nisi nihil odio aut cumque quos animi ex labore libero ullam aliquam accusamus quam ex enim dignissimos eius ipsum excepturi aut itaque beatae voluptates minima molestiae unde aliquid consequatur neque fugiat eius nisi reiciendis reprehenderit beatae nisi temporibus quo aut ratione nemo recusandae nostrum excepturi atque molestias nostrum voluptatem sed voluptatem qui.', '1', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('768', '8', 'Fugiat qui quia quod veniam enim.', 'Doloribus asperiores dolores velit incidunt sunt quae nam rem omnis dolor qui facilis aut reprehenderit aliquid quia porro consequatur ipsa ipsum sint natus ut est laboriosam placeat tempore saepe ut blanditiis omnis ut quisquam aliquam vel accusantium voluptatem voluptatem recusandae et ut enim dicta nisi iste rerum inventore consectetur et illum ratione inventore aut alias exercitationem omnis omnis qui rerum quos aut nam delectus et eveniet ducimus quidem repellat rem explicabo assumenda aut id dolorem doloribus doloribus laborum ipsa eaque laboriosam sed amet molestiae impedit quae ut rem facilis et iure sequi aut vero voluptates quidem distinctio distinctio rerum est ut esse magni earum perferendis at molestiae sint alias ad quia et sint magnam rerum illo rerum quidem nihil consequuntur quis esse sunt veniam ab quia enim molestiae quas dolores itaque enim repellat et aut tenetur fugit sit quo rerum eum debitis quibusdam enim facere dolore aperiam dicta dolores aut amet ut sapiente dicta rem sit itaque consectetur unde velit sint temporibus vel id ipsum qui ut qui sunt dolores molestias assumenda accusamus nesciunt aut ad minus vel saepe ad nobis accusantium reprehenderit assumenda rerum consequatur est porro harum velit eos sed culpa beatae ipsum voluptatum porro magnam eaque et nemo et corrupti ut assumenda ipsa ducimus magni aliquam dolores voluptate et itaque excepturi architecto earum illum sapiente quos atque cum aut quae ex aliquid consequuntur facilis dicta aspernatur ex sunt repellat odit qui sit sint sapiente molestiae maxime aspernatur nostrum quia et quia at laudantium et eaque et harum ea sint eos doloremque molestias consectetur quis quibusdam provident alias sit similique placeat nesciunt veniam provident pariatur illo qui qui sint.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('769', '5', 'Vero excepturi porro doloribus qui.', 'Inventore et odit perspiciatis soluta reprehenderit aut corporis ipsa alias hic doloremque pariatur nostrum distinctio placeat repudiandae animi debitis dolorem quasi consequatur aut porro perferendis aut velit et omnis nesciunt harum consequatur vel eaque nobis id repellat atque voluptas provident quasi cumque asperiores voluptate veniam fugit repudiandae qui explicabo numquam voluptatem facilis rerum deleniti sequi doloremque assumenda maxime maxime accusamus dignissimos eum doloremque illum quia provident ducimus unde reprehenderit voluptatem iste enim est aut voluptates eligendi autem et et incidunt ipsa similique sapiente qui sit praesentium occaecati repudiandae ab hic atque soluta iusto quia soluta cumque mollitia ad blanditiis aperiam ut aliquam hic laboriosam et cumque reiciendis atque dolores perspiciatis ut nisi alias dolorem omnis tempore modi eum nisi molestiae omnis a at voluptas ex repellendus labore mollitia voluptate et qui est aspernatur laborum laudantium qui eius sed et hic libero harum tenetur voluptatem accusamus repellat quia praesentium ad est at qui facilis nam sed eum cupiditate nemo corrupti ipsam eum et est reprehenderit dolorum neque occaecati aperiam a ea facilis quibusdam eum similique sit voluptatem iusto a voluptatem quia labore et et odio dicta culpa est ex tenetur impedit odit facere est vel eos voluptatem ut et tempora ut nobis non et impedit et voluptatum recusandae fugit nihil quam sunt quae esse dolor tenetur quo omnis velit et quidem dolor magnam suscipit cum et voluptatem enim corrupti sint autem ex eveniet ducimus repellat est molestiae perspiciatis eligendi assumenda excepturi corrupti soluta velit autem voluptate sed autem dolorem ipsum ut quos ut enim natus provident dolores laborum quo corporis.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('770', '8', 'Repellat praesentium aut voluptas rerum.', 'Optio ut quod in non animi natus temporibus suscipit eos nobis numquam soluta nesciunt mollitia cum earum dolore esse qui omnis error et pariatur mollitia non omnis dignissimos quibusdam aut et quae a amet velit et sunt et ut sunt est laborum libero aut eos quam quia provident est tempora fugit voluptate repellat sed minus labore est asperiores excepturi perferendis libero omnis harum id assumenda repudiandae ab consectetur distinctio inventore labore corporis voluptatem neque culpa id ut ducimus ipsa nihil et soluta laboriosam eum magnam asperiores dolorem aut non consequatur molestias id sunt veritatis vero ab qui aut eos maiores soluta consequatur quis laudantium expedita ex et dolore minus et voluptas et quae omnis nostrum et velit tempora deleniti et inventore nulla nemo minus aspernatur ab aspernatur consequuntur porro ea velit nam corporis id dicta praesentium impedit veniam quasi est iusto mollitia autem id eius vel voluptates harum non voluptas est enim amet sed esse magnam velit reiciendis consectetur nihil quos cumque cumque iure cumque repellat occaecati occaecati ratione expedita voluptatem illum similique quas autem enim labore ut perspiciatis reprehenderit ut soluta voluptatum nam aperiam delectus repudiandae inventore itaque consequatur nisi quod doloremque sit vitae exercitationem autem id et aut suscipit a quia error ab magnam alias totam itaque labore aut qui voluptas suscipit velit natus reprehenderit perferendis quibusdam doloribus fugit sint ipsum fuga nam impedit eveniet omnis et aliquam reprehenderit itaque quo et autem ullam repellat illo amet quasi doloremque vel repellat animi blanditiis molestiae earum explicabo repellendus qui repellendus dolorem non at veniam est libero nam non recusandae cum ipsa hic fuga similique adipisci tempore aut provident voluptatem placeat nesciunt architecto soluta placeat earum cumque qui aut quis sed illo qui quia offi