INSERT INTO `course_news` VALUES ('771', '10', 'Sint iure labore magnam aut ab consectetur est.', 'Sit illum ducimus accusantium beatae voluptatem illo harum molestiae ut aut optio doloribus voluptate eos totam vel atque eum vel sed sequi accusantium aut soluta sed repellendus nihil quis et quam cumque rerum rerum delectus nisi unde quia similique veniam odit consequuntur aut et ex accusamus beatae officia ipsa magnam cum eveniet molestiae at dolores ipsa qui voluptate eius asperiores quas illum ad id velit voluptatem quibusdam molestiae ea debitis temporibus ea dolor sit modi harum eum laboriosam voluptatem recusandae doloribus maxime doloremque qui laborum aut facilis ratione ea sapiente nihil et voluptatem ducimus aliquid minima ratione aliquid architecto ipsa in nihil maxime placeat numquam aut in incidunt dolor doloribus aperiam optio sunt minus illo et neque dolores in rem voluptatem consequatur quae nam sunt possimus fugit porro nesciunt adipisci non adipisci est pariatur facilis numquam laudantium non quo nisi ea eum doloremque eveniet voluptatem mollitia ratione voluptas sunt suscipit quo error neque itaque accusantium aut ab est similique dolorem praesentium odit rerum et quia quia dolore aut asperiores iure voluptas reprehenderit quia minima reprehenderit rerum qui fugiat corrupti sit architecto illum iusto odio nemo laudantium corporis iste aut consectetur recusandae voluptatem ut facere error quia molestiae libero sed quibusdam adipisci in qui repellat eos consequatur harum est occaecati quia qui in quisquam occaecati quasi qui sequi labore numquam qui aut possimus rem dolor velit id eius dicta mollitia consequatur adipisci vel fugit voluptatem nisi laboriosam et adipisci nobis doloremque architecto et et optio non nihil aut voluptatem atque earum officiis at beatae architecto eos qui tenetur ut sint nam consequuntur ipsa ut illo corporis non dolor perspiciatis qui est aut modi rerum pariatur sint eaque nihil animi magni deserunt neque error nulla qui inventore ullam omnis aperiam placeat.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('772', '4', 'Voluptatibus rerum occaecati numquam ut dolores laudantium.', 'Hic aspernatur necessitatibus vero aut eligendi id sit dolor fugiat iure labore at est repudiandae velit porro qui aut rerum omnis autem architecto ad consequatur rerum laudantium veritatis et tempore perspiciatis beatae itaque debitis occaecati at voluptas sunt beatae perferendis nulla quia consequatur dolorum cum aut ut inventore et sunt vel natus reprehenderit occaecati laborum dolores voluptates atque quasi nostrum ut ut et corporis autem cumque numquam magni reprehenderit amet perspiciatis delectus provident ut praesentium voluptates quia dignissimos sequi rerum ut sed ea quos et nostrum nesciunt qui et minus nihil in recusandae ipsa ducimus accusantium dolor est sit in laudantium dolorum laborum blanditiis dolorum in voluptatibus ut impedit quaerat incidunt praesentium aut est in sapiente tempore in voluptas et sed incidunt laborum delectus est ullam consequatur officiis dolor quibusdam voluptatibus eveniet praesentium sed illum hic aliquam voluptates mollitia nihil sint qui autem aspernatur accusantium animi est dolorum vitae quibusdam deleniti officia consequatur laudantium natus aut corrupti voluptates impedit et molestiae aliquid sed molestias aliquid consectetur animi laudantium necessitatibus beatae sit dolor enim voluptas alias et illo mollitia eos facere qui minima accusantium veritatis voluptate vel tempore commodi inventore aut quaerat velit nisi quis aliquam consequuntur qui aut possimus nesciunt aut qui et velit ut.', '0', '2017-05-02 22:59:29', '2017-05-02 22:59:29');
INSERT INTO `course_news` VALUES ('773', '3', 'Ipsum odio dolor impedit dolorum sint et.', 'Consequatur consequatur assumenda quia culpa reprehenderit sed voluptatem inventore esse ut quia dicta sit enim ratione consequuntur et quia praesentium unde unde asperiores qui pariatur ipsam eos et eaque quia repudiandae labore dolor qui qui saepe repellendus atque nobis ea quam reprehenderit deleniti est sapiente tempora dolor veritatis unde totam dolores eum possimus non blanditiis placeat odio molestias quo magnam nam dolorem natus tempora dignissimos et fuga accusantium aut rerum recusandae esse laborum repellat ratione accusantium et perferendis ab fuga blanditiis quia rerum consequatur assumenda quo ut molestiae vel at quibusdam neque eveniet maxime soluta non nesciunt qui qui omnis vel magnam rerum incidunt omnis corporis rem molestias harum ratione esse voluptate qui sint eligendi repellat sed consequatur culpa rerum sit rerum id dolorum nulla quis minus commodi praesentium sed dolor id explicabo magnam veniam architecto ut modi libero quas omnis dolorem tempore blanditiis rem facere provident praesentium fugit adipisci porro non quam magni minima dolor suscipit voluptas consequatur optio est id ipsam tempore officia aut et excepturi molestiae expedita praesentium tempora ex in sequi delectus nostrum id quam rem ipsa est autem quia magnam consequatur voluptatem quo officiis ea beatae est officia officia ut corrupti dolorum consectetur aut cupiditate deleniti cumque iusto earum dolor laboriosam nihil tenetur provident et beatae adipisci nobis natus cupiditate aut placeat sunt tempore maxime voluptatem odio dolore provident pariatur libero odit nihil ut sint rerum rem nihil non rerum quas laborum ea quos qui quo omnis omnis sit a et quisquam exercitationem dolorum natus et ad quia hic dignissimos eos quibusdam veritatis ut labore aut porro eligendi ad qui error minus rerum distinctio fugit consectetur dolores enim qui a occaecati placeat eaque voluptatem autem ut voluptas odit aut molestiae quidem nulla deleniti enim ipsa eum explicabo assumenda nostrum ipsa reiciendis similique est qui non vitae cupiditate incidunt est perspiciatis quos nam consequuntur qui molestias nihil accusamus exercitationem illo iste enim.', '1', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('774', '6', 'Aliquam aliquam quae vel molestiae.', 'Iure quia doloremque voluptates unde voluptatem dignissimos amet qui aliquam voluptates quos animi est officiis consequuntur et vitae vitae recusandae quibusdam quas assumenda expedita et voluptas asperiores deserunt omnis facilis non delectus omnis officia beatae architecto soluta dolores placeat temporibus amet eos consectetur et dolorem ut officia dolorem nobis esse non corrupti eum hic voluptas perspiciatis corrupti voluptatem quaerat fugit ipsam qui molestiae et blanditiis cumque sunt illum sapiente ea iste eveniet earum voluptas ea aut rerum et sed sapiente porro vel impedit doloribus autem similique sed tenetur est molestias sint earum facilis vel ducimus numquam et ducimus sint est doloremque architecto exercitationem earum perspiciatis harum cum soluta voluptatem aliquid beatae sed in quia reprehenderit neque optio facilis iure laudantium qui rem optio asperiores voluptas harum ducimus consequatur asperiores cumque ea quia sed consequatur ut ut vel facilis natus sit ipsum ad qui id natus architecto ad consequatur neque aut sint assumenda beatae repellendus ad explicabo ex ipsa est ex id qui expedita repudiandae rerum et distinctio dolor ea qui eligendi optio porro qui quasi vero non suscipit omnis sapiente aut non itaque non sint laborum nulla sed dignissimos quae officia odio aspernatur aut dolorum sed molestiae eaque et sed sunt eum velit iusto non aut et vel quo earum fuga neque ipsum quia excepturi quis inventore fugiat quia sed repellendus fuga asperiores qui nobis tempore sit modi voluptate asperiores quia minus consequatur corporis sunt excepturi perferendis aperiam alias neque error illum repudiandae dolorum sed ipsum vel reprehenderit aliquid quisquam non fugit autem nobis corporis harum possimus enim sed consequatur libero ipsa consequatur officia ut eligendi optio et sint asperiores praesentium hic fugiat optio provident consequuntur ipsam molestiae non sunt iste cupiditate qui quaerat dolores natus et facere unde rem nisi enim iusto fugiat iure sit rerum eius.', '1', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('775', '4', 'Beatae minus labore nam accusamus in quibusdam facere.', 'Dignissimos voluptas temporibus sint voluptas iste veritatis tenetur ipsa nostrum voluptatem exercitationem quisquam minus officia inventore vel qui dolor maiores et et odio et et vel vel repellat voluptatem quos sit aliquam necessitatibus deserunt magni qui distinctio ut voluptates et rerum nisi ut nobis dolorum recusandae ea rerum voluptas consequuntur corrupti voluptates dignissimos aut dolore eum vitae tempore soluta quia voluptatem excepturi ut maxime alias maiores omnis eaque doloribus ex non quidem quae est omnis dolor fugiat quis eveniet id suscipit perferendis quod ducimus possimus cum assumenda velit illum maiores voluptate nisi aut adipisci cupiditate temporibus aut consequatur vel iste ducimus perferendis laboriosam saepe enim sit incidunt possimus adipisci illum et nam aut neque consequatur voluptatem voluptatem cumque aut exercitationem eos distinctio in est rerum aut et voluptatibus veniam nemo non debitis nihil nesciunt quidem necessitatibus accusamus quibusdam voluptatem sequi repudiandae rerum doloribus dolorum ipsum praesentium aut quia consequatur quae consequuntur mollitia est rerum autem beatae nesciunt quis cum repudiandae quia voluptatem aut aut iusto ipsum sit ipsa quia iure delectus earum aut quia aut eos alias assumenda aut eius rem dolor ipsa fugit dolores sint id et quod omnis.', '0', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('776', '9', 'Ipsa dolor aperiam expedita voluptate quasi illo rerum.', 'Quas quod rerum cumque architecto debitis quo quis aut magni deserunt aut mollitia tempore ut inventore impedit cumque ullam natus aut voluptas quos magni velit ipsam ducimus quia dolorem illum pariatur minima blanditiis officia provident qui quisquam nihil odio ut odit ex adipisci dicta minus aut id exercitationem est molestiae voluptate dolor atque et aperiam voluptas repellat amet voluptas soluta harum tempora dignissimos quia et odio reiciendis quia architecto dolorum ut voluptatibus dolores quis sint enim et ad et sunt blanditiis eos dicta autem vel non ratione molestiae et animi molestiae voluptas quia aliquid omnis non libero ut nemo necessitatibus dolorem voluptatem velit aliquam voluptatum deleniti libero esse et suscipit non placeat quisquam eligendi hic repellendus officia rerum voluptatem ut consequuntur voluptatem doloribus aut sunt corporis voluptates quia deleniti voluptatem qui aut et expedita sint dolorem officia quia eos tempora et quis et velit sed est sit qui aut sed repellendus nam reprehenderit quas aliquid adipisci vero aut asperiores ut dolores nulla aliquid quo et quia voluptatem consectetur ratione eligendi sequi doloremque odit expedita commodi dolorum numquam quis quas iusto molestiae facere corporis dolore placeat et dicta consequatur soluta eaque quod voluptas doloremque sit non facilis neque suscipit quia est autem nobis at voluptas voluptas distinctio dolores omnis minima adipisci eum et iusto ipsum iste ipsum aut asperiores et sunt odio vitae autem molestiae architecto qui dolorem rerum ad voluptatem impedit nam odit autem exercitationem quis unde itaque et sit voluptatibus vitae quia quia voluptatem suscipit repudiandae consequatur quam dicta velit blanditiis voluptatem commodi exercitationem asperiores perspiciatis omnis enim porro voluptas cumque repellat dolore magnam tenetur voluptatem nobis officia aut nesciunt expedita aut vero rerum sed neque incidunt nesciunt provident hic aut nam quae quod nisi rem sint omnis dolore quidem molestias sit autem autem accusamus iure neque ut accusantium corrupti suscipit accusantium itaque veritatis quo iste explicabo neque mollitia omnis culpa illo perferendis fuga nulla et dignissimos expedita eveniet rerum quod natus et enim illum ea et deleniti qui autem molestiae totam laboriosam est nisi sequi ex non error.', '0', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('777', '10', 'Sed sint at nisi non.', 'Distinctio dolorum corporis doloribus sunt consectetur aspernatur inventore unde quis id nostrum repellat quos assumenda omnis officia facere aut incidunt enim ut voluptas nesciunt omnis minus aut ea sunt nostrum qui dolor sit velit placeat voluptatibus nobis quia in iste eum error quo quia commodi tempora minima distinctio molestiae qui quis nemo tempore libero sapiente commodi quis in facere non officiis ducimus et consequatur consequuntur dignissimos neque et perspiciatis sit in eos ea illo eveniet illo cupiditate dolores error vel harum consequatur fugiat nesciunt quos omnis cumque qui temporibus suscipit enim voluptatem voluptas sit adipisci soluta pariatur rerum nulla sapiente occaecati assumenda officiis est veritatis praesentium sunt amet ut aliquam perferendis aut impedit voluptate harum quia labore ratione sit totam unde est temporibus qui dolores nihil repudiandae ut provident et quo est quam aut quod aut quae culpa numquam harum et voluptatem alias veritatis exercitationem rerum ratione quo et aperiam consectetur aut quia molestiae saepe eum aut voluptas occaecati recusandae omnis non aut fugit distinctio ad temporibus saepe eius sint rem atque id hic quia voluptas eos et nihil sequi nemo velit ea reiciendis voluptatem rerum ut nisi aperiam natus nihil odio ex pariatur doloribus sint molestias eum qui omnis ducimus consequatur tenetur voluptate iste nulla ea sint optio commodi voluptatem similique dolore qui facilis enim enim nulla et sint fuga ducimus dicta laborum corrupti eius nisi veniam quo quo quibusdam quos sapiente qui maiores aut cupiditate expedita quod et optio exercitationem ipsam sunt explicabo laborum repellat culpa reprehenderit animi dolorem voluptas itaque ea impedit doloremque et voluptas ullam accusamus magnam possimus cum id nemo quae exercitationem aut quas nulla porro exercitationem suscipit voluptatum earum consequatur fuga eum rem sed voluptas dolorem id dolorem error culpa ut vel similique quia sed molestiae molestias sequi officia earum et est at sunt velit asperiores eos sunt corporis assumenda minima quod quod occaecati ad voluptas autem fugiat consequatur veritatis vitae doloremque deserunt voluptatem voluptas ab et quis doloribus est a voluptatem ipsa sunt architecto quaerat nobis molestiae ex veniam reprehenderit necessitatibus ut ut enim enim et omnis sapiente non ut neque doloribus facere atque ut et aspernatur labore enim reiciendis quasi amet molestiae sit minus possimus ex recusandae eligendi unde pariatur ut officiis ut provident autem aut esse est similique corrupti iure aspernatur est dolorem quis repellendus unde sint molestiae sapiente quos vitae libero perspiciatis omnis fugiat id explicabo omnis corporis impedit sequi vel ducimus optio fugiat odio placeat.', '0', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('778', '3', 'Molestiae porro sed animi hic.', 'Accusantium ut dolor cumque quo omnis laboriosam quasi est dolor quam repellendus dolores sint eius nostrum voluptates aliquid doloremque omnis exercitationem omnis ut iste qui et quo animi nam doloremque qui distinctio ut voluptatem occaecati vero dolor corporis labore et qui dolor dolor dicta est facere tempora quasi quos deserunt magnam dolorem cumque sit dolorem aut excepturi quisquam laboriosam ullam a aliquid repellendus possimus ut quo ut id minima corrupti qui dolorem aperiam voluptates ea ad architecto culpa adipisci nihil deserunt alias rerum aspernatur molestiae est repellat harum recusandae architecto voluptatem est sapiente minus laboriosam molestias cumque dignissimos sit reprehenderit fuga odit sint deserunt rerum ut asperiores aut et voluptatum et quae facere quam at non quia nobis dolores vitae qui consequatur expedita recusandae sit adipisci adipisci quae et voluptate sed debitis nisi non quisquam sed est magnam dignissimos odio enim est ullam officiis commodi sunt molestiae natus praesentium sit et sunt accusamus eveniet accusamus molestiae voluptatem ut quod quibusdam quo ea enim suscipit ut enim reprehenderit in corrupti optio occaecati aliquam assumenda maiores rem voluptatum sed labore blanditiis rerum soluta sit est et quia eum consequatur facere commodi aut suscipit culpa consectetur cum iste sed sed modi nostrum sint omnis non corrupti sunt minus incidunt explicabo iusto nam ab facilis vel sunt qui tempore corporis unde quod optio soluta eaque odit ipsum blanditiis explicabo fugiat et voluptatem dolorem necessitatibus dolor vel officiis alias voluptatibus dignissimos perspiciatis excepturi minima eum ea velit distinctio quasi quas cumque tempora odit maiores consequatur nulla molestiae laborum dolore repellat dolores sed dolorem aliquid quaerat corrupti modi corporis sed labore voluptatem omnis ut dolor pariatur non totam ratione sed sunt ratione enim consequat