INSERT INTO `course_news` VALUES ('779', '2', 'Dolor quibusdam ab minima ipsam eos qui quia corporis.', 'Aut dolor quia amet temporibus harum voluptates assumenda quas laborum explicabo quo dicta animi error ut nulla aliquid accusantium eveniet sed excepturi voluptates eius corrupti quas consequatur et consequatur iusto aut reiciendis dolorem debitis quo voluptate minus atque ea repellendus placeat est dolor culpa eius blanditiis porro itaque voluptas quam eaque nulla deserunt omnis quam ab nulla quae doloribus aliquid aut et aut fugiat aspernatur placeat autem inventore quidem in quibusdam eos iusto maxime voluptatem ut rerum vitae natus rerum harum sed doloremque sed nostrum voluptatem cum ipsa omnis sint sapiente sed architecto modi odit quidem facilis sapiente consequatur eos perferendis vero deserunt vero ipsa praesentium minima ipsum cum necessitatibus amet earum fugit vel quasi possimus veritatis numquam dolorem quia corrupti vel provident molestias et consequuntur et omnis nam dolorum incidunt voluptatem libero sed maiores dolorem laborum autem doloremque quas ut dolor aliquam eos aut neque et vitae laboriosam ex et harum aliquid labore voluptates omnis iure error dolor delectus nesciunt architecto fugit est molestiae fugiat quas cupiditate alias a dolores corporis quia autem explicabo quasi quibusdam omnis blanditiis recusandae ut fuga aut placeat reiciendis est pariatur ut sed nulla.', '1', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('780', '2', 'Harum corrupti repellendus quidem qui pariatur soluta sunt.', 'Blanditiis error ex velit aut culpa et vel molestiae harum et consectetur modi consectetur sint excepturi cum adipisci dolores nulla quo magnam sit ipsa quia et eos voluptatum animi saepe atque itaque doloremque accusantium tempora repellendus omnis dolore cupiditate aut tempora nulla non quidem adipisci qui fuga fugiat et sed et corporis et et eos ut ab tempore similique eaque rerum ut harum sunt quam ipsa eos quia vitae ratione rerum quidem id voluptatem commodi ducimus perspiciatis nisi molestiae magnam ab natus voluptates quia fugit distinctio placeat ut ea qui sit error ratione mollitia aspernatur natus nihil vero quaerat saepe nostrum alias non consequatur rerum rem voluptas in iure dolorem reiciendis maiores error rem itaque eum fuga voluptas dolores dolor et eius modi nobis adipisci perferendis praesentium rerum eius laborum non nobis ad dolorem totam est ut explicabo et nulla modi ut odio odio aperiam provident eius placeat voluptatem quisquam non dolorem et ad id cumque perferendis ut quis reiciendis neque assumenda consectetur eum facilis odio dolores excepturi recusandae blanditiis sunt temporibus porro error nihil sint ipsam quos veritatis dolorem fugiat consequatur eius et saepe magni laborum dicta sit ut magnam occaecati voluptatem dolore dolores id rerum eos dolore enim et eum nulla cumque optio nulla voluptas dolores nesciunt magnam fuga itaque aperiam nam rem autem voluptatem veritatis corporis perspiciatis expedita possimus alias et odit ut velit sit assumenda quis enim ex perspiciatis natus quibusdam quo explicabo molestiae enim iure eaque ut incidunt et aut perspiciatis eius quia consequatur illo laboriosam recusandae natus tempora porro et rerum expedita eum numquam officia delectus tempora aut occaecati aut et qui delectus quibusdam debitis quasi esse aut cumque et quod vel modi animi consequatur voluptatum blanditiis voluptatibus mole