INSERT INTO `course_news` VALUES ('781', '2', 'Sint architecto a necessitatibus molestias esse est.', 'Similique autem provident veritatis ducimus beatae sunt reiciendis ut quo quia nihil quia non esse porro qui hic tempora explicabo id quo tempora qui autem aut minima repellendus ut odit consequatur alias harum voluptas occaecati sed ex sunt molestiae sint molestiae optio earum quia numquam omnis dignissimos sit dicta quasi qui aut quisquam delectus nemo saepe maiores aspernatur quas quia laudantium iusto quis accusantium ex cupiditate fugit sapiente tempore quis esse nihil nisi aut omnis aliquam praesentium omnis exercitationem expedita quos dolores eos ut voluptas ipsam vel et deleniti commodi voluptatem optio sint ab ut est cum ab quis ipsum accusamus consequuntur iste nostrum cumque incidunt voluptas nostrum quae veniam ex sequi qui et blanditiis id est voluptatum odio neque vitae ut enim id voluptas alias doloremque perferendis corporis rem sit laborum vel saepe voluptatem ut odio ex quos dicta qui dicta iure est est tenetur laboriosam ducimus accusamus quaerat nihil reiciendis rem aut facilis eius nam iusto inventore facilis iure est nam non velit illo sed eos fugiat nulla fugit tempora dolore nisi sapiente et enim possimus laborum laboriosam nemo natus consectetur atque quis ea excepturi non dolor id non perspiciatis incidunt voluptatem voluptas natus numquam officiis impedit non nihil enim voluptatum nisi iste blanditiis et voluptatem consectetur eveniet tempora recusandae in quae et dignissimos ut provident nulla rerum nostrum deleniti fuga deserunt repudiandae recusandae perferendis necessitatibus enim corrupti animi aut architecto est consequuntur qui accusantium maxime cum aut sapiente et vel minus libero et est earum nemo neque nihil possimus minus id assumenda voluptates et maxime recusandae nihil nam unde temporibus aut velit dignissimos quisquam dolorem ratione molestias aut nisi et modi ut iste assumenda quidem recusandae eius et fugiat maxime voluptate commodi veniam aliquam minus eveniet rerum ratione in et culpa officiis molestiae saepe eos corrupti error et voluptate veritatis architecto ut quia autem sit doloribus facilis natus perspiciatis animi est porro veniam unde sed soluta dolor debitis sunt ab quisquam nihil animi a omnis velit at explicabo aut dolorem et quaerat est fugiat facere sit sed maiores et consequatur ut at aperiam quo velit aut sequi quae neque amet quisquam incidunt.', '0', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('782', '10', 'Aliquid repellendus aut est asperiores quae non cum.', 'Praesentium qui quaerat perferendis expedita sed aliquid itaque repudiandae laudantium neque illo labore velit necessitatibus facere temporibus maxime totam harum quisquam velit ut aspernatur nisi reiciendis culpa officiis laboriosam perspiciatis similique reiciendis vero nihil consequatur sed numquam sequi perferendis vero sed aperiam explicabo vel tempore sed ut quis id distinctio ex sit ea est vitae qui aut dolores rerum placeat est quam dignissimos earum possimus saepe iure qui quae doloribus quia tempore qui totam necessitatibus omnis aut vitae placeat suscipit cupiditate quis autem omnis quaerat molestiae nam quisquam error sunt quas sit quod aperiam laudantium id repellat alias ad quia dolorem error voluptas quasi explicabo sunt eveniet eos ipsam dolor non earum consequatur dolore esse deserunt laboriosam quibusdam in odio amet praesentium voluptatem tempore expedita quia placeat autem earum ullam similique quia dolores vel voluptate ea voluptatem non laborum maxime delectus totam aut tenetur et ducimus exercitationem sunt quisquam nihil quam repellat et vel expedita accusantium quibusdam quod velit quis non ea sunt assumenda est nesciunt odio sed in sit soluta qui iure qui amet vitae amet quia sint reprehenderit recusandae impedit corrupti itaque et voluptas qui sint officiis quis saepe corrupti beatae quia et quod molestias distinctio impedit aut nihil ad similique quia hic aspernatur dolores nemo omnis consequatur laboriosam necessitatibus est libero hic a dolor harum nemo illo quaerat autem doloremque quod nobis nostrum consectetur assumenda officiis autem ab cum atque quas esse magnam veniam minus quas blanditiis minima ab assumenda quidem reprehenderit libero blanditiis qui consequatur qui non et sapiente et blanditiis fugiat temporibus ut esse consectetur vero hic tenetur et quas quam qui est error quasi reiciendis nostrum doloremque laudantium debitis ut et necessitatibus ut explicabo ut unde totam aliquid illum quasi impedit consequatur velit qui consequuntur ipsam est quia aut velit sit harum sapiente deserunt quasi voluptatem omnis dolores eos tempora alias nemo consequatur repudiandae similique ut consequuntur.', '1', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('783', '1', 'Voluptates nulla voluptatem atque ipsum.', 'Tempore sed voluptas voluptate molestiae quo voluptatem quod illo qui ut mollitia dolor velit sit debitis enim iure quisquam exercitationem omnis est laboriosam ducimus omnis ut odio consectetur deserunt sunt nihil voluptatibus incidunt fuga vero sapiente at quaerat excepturi corporis soluta consequatur qui est quis consequatur ipsa facere ipsum voluptatum repudiandae sunt ut non voluptas sit vel et quas commodi est corporis ratione magni consequatur voluptatem aspernatur iusto non assumenda sunt voluptates et beatae dolor occaecati autem optio consectetur nisi beatae nobis et id delectus illum et repellendus aut accusamus culpa vel delectus aliquid similique error adipisci quia maxime et rerum praesentium animi at voluptatem sequi velit quia aut eius architecto incidunt rerum officiis ratione nisi aut distinctio accusamus et inventore ut qui animi esse autem deleniti commodi amet neque occaecati dolorum quisquam aliquam voluptatibus dolorem amet sit eius repellendus et veritatis quasi sed et et in nemo aut autem corrupti iure delectus minima sint molestias omnis rerum dolorum nobis quia voluptas omnis doloremque molestias omnis tenetur neque pariatur ut corporis qui consequatur dolores tenetur sunt voluptas sit iure eius temporibus ut fuga a adipisci ut quasi omnis ut aut dolorum enim et optio id rem vitae in voluptates quia est rem distinctio optio nemo deleniti inventore sed non sed excepturi porro minus distinctio consequatur voluptas aliquid ut voluptates maiores laboriosam qui illum qui numquam quasi eos laborum et unde nihil hic blanditiis libero aut repellendus nesciunt vero deleniti numquam minima et nisi pariatur odit porro ullam delectus quia voluptatem voluptates commodi dicta neque tempore illum soluta labore natus delectus autem ullam tenetur sed ullam laboriosam suscipit exercitationem nostrum dignissimos ut consequuntur modi consectetur et laboriosam tempora perspiciatis id sed exercitationem et nesciunt fuga rerum voluptas officiis modi quo aut error qui ea alias vitae dolores numquam totam accusantium vitae ab.', '0', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('784', '7', 'Impedit minus quasi ut minus et inventore eligendi.', 'Eligendi in quas ut natus dolore ut libero animi quo a beatae iste voluptas officiis praesentium beatae consequatur tempore consequatur laboriosam blanditiis pariatur sed consequatur eum deserunt praesentium voluptas voluptatibus saepe voluptatem iste neque repellendus ea ipsum sit tempora ut voluptatem dolores voluptatibus voluptates neque iusto et qui nisi est tempora nobis cum reiciendis consequatur labore quia optio recusandae ut in veritatis et dolorem laudantium id vel quia sunt aliquam reprehenderit quas laborum ullam expedita dolor dolore minus mollitia cumque tempore voluptas quia itaque voluptate reiciendis neque dolorem et mollitia est est perferendis nulla ex quod aspernatur quam ipsum sint deserunt tempore voluptatem quia a atque nobis placeat repellat provident voluptatum illo et nemo nam debitis dicta inventore rerum libero quam quaerat laborum temporibus porro recusandae modi eius est optio est odit nihil harum facere rem eum minus modi magnam id ratione voluptatibus accusantium sapiente quo reprehenderit sed sit quo consequatur rerum libero iusto consequatur iure beatae aut accusantium maxime rerum mollitia velit aut commodi nemo excepturi libero inventore dolorem quisquam quia odio similique illum magnam quia consequuntur expedita vero ea est soluta laboriosam asperiores deleniti optio debitis vel qui occaecati reprehenderit a.', '0', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('785', '8', 'Non in cupiditate vitae at.', 'Quos delectus enim blanditiis sapiente dolore modi nesciunt corporis omnis ab tenetur aut fugit nisi quisquam rerum cupiditate ipsa libero qui ut ut dolores temporibus soluta consequatur assumenda quia recusandae consequatur modi eos repudiandae nobis aut blanditiis natus repudiandae exercitationem magnam repellat exercitationem tempora animi unde necessitatibus exercitationem iste nisi doloribus molestias ad voluptas cumque reprehenderit quaerat voluptas aliquid consectetur dolorem beatae occaecati voluptate assumenda perspiciatis aperiam nesciunt quia quo non et eius maiores sint commodi ipsum numquam eos voluptatem deserunt nulla minus ullam iusto repellendus modi exercitationem enim mollitia hic et vitae itaque et omnis maiores fugit optio quas laboriosam omnis dolorem qui fuga explicabo quisquam minus doloremque repellat enim vel magni a nam et quisquam qui sit vel voluptatum illum quod magnam provident quia qui sunt laborum ullam corrupti nemo harum quaerat iusto voluptates eum placeat explicabo excepturi ut ab dolorum rem non reprehenderit accusantium incidunt architecto tempora reiciendis harum maiores qui ab nihil corrupti at ratione sit alias placeat pariatur sequi vero quam odit et ipsam consectetur itaque dolor saepe et esse eos accusamus praesentium culpa dolor et exercitationem sed nam id voluptas nostrum quia incidunt impedit dolor tenetur est enim ipsum atque eum sint qui et sapiente magnam cupiditate vel voluptatibus sunt facere sunt eum perspiciatis officiis expedita maiores qui facilis ullam voluptatem ut rem illo sed id perferendis culpa placeat neque harum eum cumque et id veniam omnis facere fugit dolorem ipsam ea deleniti molestiae maiores sapiente tempora ex perferendis vel cumque illo non corrupti iure officia provident reiciendis est sint non nihil consequatur exercitationem incidunt quis a pariatur natus nisi dolores at placeat facere rerum sit enim ipsam ducimus quae voluptatibus impedit sequi voluptatem quibusdam molestiae et esse tenetur temporibus veniam maxime occaecati harum nihil omnis numquam eius et magni optio est quia earum occaecati sapiente iste iste et quas reprehenderit eveniet quam eligendi est blanditiis ullam animi labore sequi.', '1', '2017-05-02 22:59:30', '2017-05-02 22:59:30');
INSERT INTO `course_news` VALUES ('786', '8', 'Est magnam amet omnis molestiae ut inventore velit.', 'Quibusdam dolorem molestiae doloribus illo unde est alias sit deserunt vel molestias voluptas ipsa illum velit ab et ex consequatur rerum recusandae magnam odio et debitis qui quia harum occaecati dolor nisi fugiat est illo magni eos doloribus mollitia voluptatum odio hic non ea unde commodi dolor nihil et aut omnis voluptatem consequatur odio itaque voluptas aut eum vel quisquam illo laudantium in minima et perferendis rerum et vel et nesciunt quaerat debitis animi aperiam quasi ut qui non et quae provident explicabo nam reiciendis nesciunt id veritatis aut soluta eum mollitia iure et cum maiores facere excepturi praesentium molestiae cum nostrum tempore ratione sed mollitia laboriosam qui ut quis voluptas sed aut enim velit aperiam alias laudantium temporibus ea possimus ab ut recusandae et laudantium mollitia culpa ut culpa eum vel consequatur nesciunt fuga iusto natus aut dolor et rerum error sit quas numquam explicabo eos illum possimus fuga sint reprehenderit ea voluptatum adipisci eos eos id fugit dolor sit aperiam doloremque distinctio quibusdam et error corrupti non eum aut doloribus deleniti voluptas quidem accusantium quis maxime non accusamus est sit sit laboriosam cum et labore amet ut nesciunt laboriosam temporibus tempora debitis quos ad totam nam omnis explicabo a placeat aut laboriosam totam similique ipsa saepe voluptatem quia delectus et molestias modi harum alias expedita quod quibusdam animi quas ullam molestiae quis dolor omnis sit nisi nihil placeat et autem optio quas assumenda accusamus molestiae repellendus quas ut nihil reiciendis et corporis quisquam porro corrupti provident adipisci nisi numquam sint reiciendis enim repellendus asperiores quos atque quisquam illum sapiente dolorem consequuntur numquam accusamus tenetur veritatis voluptate enim sapiente explicabo assumenda ipsum eum nihil a voluptatem fugit est in unde ducimus unde aperia