INSERT INTO `course_news` VALUES ('789', '3', 'Autem quod natus qui dolores rem.', 'In et et quia exercitationem quae vel eos consequatur cum autem adipisci a iure labore dolores omnis ex ipsa beatae autem voluptatem voluptatem placeat dignissimos non unde in itaque officiis eos ab quia dolor officia quo ab quia inventore voluptatem sunt molestias ab est dolores quod dolor ut et qui nihil maxime ipsam perspiciatis sint debitis vel et quasi ipsa eligendi sit ut doloremque natus temporibus rerum est est facilis non natus odio repudiandae eaque error sed et dolorum dolorem illum voluptatem est quis corrupti est et illum officiis ipsam id molestias molestias atque distinctio molestiae repellat magni dolorem in in molestiae nesciunt commodi eum eligendi magnam perspiciatis rerum doloremque quis delectus et sed aut nesciunt suscipit qui rerum est aliquam eum numquam aliquam sed asperiores voluptates dolor cupiditate hic possimus autem quae voluptatem voluptatum qui dolores rerum ipsam et sapiente sit aliquam expedita quis officia dolore deleniti omnis consectetur voluptatem officiis autem quae ea accusantium est ab doloremque explicabo a molestiae sint ad vitae quia et vel rerum odio nemo voluptatem dolor et quas ducimus vel quis nobis officia aut eaque dolores est doloremque voluptatum dolores occaecati ducimus ut aut pariatur quam soluta et aut omnis est dolor labore vel et exercitationem cupiditate et distinctio autem aliquam amet unde quod beatae natus unde dolores placeat labore autem quas dicta eius qui illum ut est dolorum non consectetur officiis dolore quis autem et suscipit est asperiores qui eaque omnis et explicabo quaerat cumque pariatur ut id suscipit sit labore et quos laborum possimus aperiam ad neque quibusdam consequatur necessitatibus error et perferendis et porro eum amet ut nostrum magnam asperiores fugiat dolor voluptatem et odit quia velit qui sunt eveniet omnis doloribus id sit rerum aut ut similique voluptatibus reprehenderit soluta itaque non aut