INSERT INTO `course_news` VALUES ('795', '4', 'Nisi dolores dolor necessitatibus dolore quia quia.', 'Fuga blanditiis quaerat dolores illum voluptatem iure earum nemo dolorem nihil quia doloremque occaecati ea vitae ut illo iste qui nemo odio autem facere labore delectus voluptas maiores itaque est doloribus eligendi velit sunt et soluta tempore in optio ut ad rem qui incidunt quia eius error aut et neque nobis qui aspernatur quia nam assumenda quod est cum perspiciatis delectus incidunt id non dolorem id quaerat modi nulla voluptas ipsum consequatur facere et minima minima placeat excepturi eum rem itaque quia illo deserunt quas corporis facilis et libero distinctio quia amet maiores alias sint repellendus perferendis velit alias molestiae voluptas molestias voluptatum illo qui adipisci sunt culpa voluptas exercitationem qui iste sequi fuga consequatur optio dolorem et quos at labore veniam ducimus nulla inventore id praesentium delectus est alias odio ipsum sunt velit quia dicta placeat veniam atque pariatur qui aut ut quasi non ex repudiandae est at et in unde dolore ut magnam aliquid voluptatibus quia itaque voluptatem vero explicabo quia deleniti repudiandae incidunt harum quia sequi ut sint eum occaecati ut repellendus non exercitationem temporibus odio ad et nemo ipsum officia exercitationem eveniet itaque qui quo et non aut eaque vero tenetur voluptas totam eum id dicta nihil velit et inventore ea rerum ut est quo consequatur harum laboriosam voluptatem dolores accusantium aut mollitia dolor at eligendi impedit sed nobis quos reiciendis debitis eum quo est aut ex rerum veritatis saepe consequuntur architecto fugiat enim cupiditate totam labore voluptate harum quia temporibus esse tempora provident magni illo eum non distinctio autem qui ea et sequi non eligendi ut cupiditate vitae culpa ut dolorem amet non libero magnam id consequatur provident numquam magnam eius sint quae et similique assumenda qui voluptatum aut necessitatibus et eos dolorum vero aut quam