INSERT INTO `course_news` VALUES ('796', '7', 'Aliquam et velit temporibus officiis ut debitis quia.', 'Pariatur rerum esse ut ad laudantium est dolorem consequatur iure labore voluptatum nam soluta nihil id aliquam velit aut minus et dolor quisquam assumenda enim et quas molestias autem voluptatem saepe sequi iusto quis voluptas pariatur et quis libero enim et harum dolorum ut temporibus ab et magnam enim est deserunt rerum vel provident assumenda fuga et culpa deserunt rerum pariatur tempora sint quia sunt perspiciatis dolores ratione impedit odit rerum facilis nisi sed nemo sapiente ut nemo impedit ab harum odio tempore officiis iure quas fuga illum iste dolor at iusto vel dolore sapiente quia ut qui sed nihil quidem esse autem id voluptatem veritatis sed consequatur iusto quas provident officia aut blanditiis aut quis quia ducimus porro ullam aliquid dicta qui fugit autem tempora labore et enim sit aut esse recusandae pariatur iusto architecto et modi ad alias sunt et quos sit est quos consequuntur adipisci quod fuga autem eum repudiandae unde illum ipsa quia non aspernatur sapiente sint aspernatur consequatur quae eligendi qui distinctio in quam aliquam a eum sequi aliquam corporis omnis quidem harum sequi occaecati voluptatem et veritatis delectus molestiae id fugit facilis nam occaecati deleniti dolor velit voluptatem corrupti nesciunt harum nulla in ipsa veniam officia tempore accusantium voluptatum labore tenetur voluptatem rerum omnis vel porro vero doloribus velit ducimus nihil dicta neque vel vel optio eos placeat nam sequi culpa officia magnam nemo quisquam voluptas.', '0', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('797', '2', 'Doloribus quis perspiciatis nostrum quaerat velit sint voluptate.', 'Facilis distinctio quia repellendus est aspernatur libero dolores non quia aut cum fugiat sunt omnis impedit laudantium at quae quae consequatur ducimus libero aut fugit atque nulla quos fuga quae labore qui repellendus aut quaerat ipsum laudantium fugiat qui amet aut porro saepe quidem nisi repellat qui inventore exercitationem qui necessitatibus rerum eligendi ut reiciendis harum nesciunt odio sunt voluptatibus non sapiente nihil blanditiis maiores est quia aliquid ab non et quidem ut doloribus et vel et omnis cum ullam asperiores ipsam voluptas aut rerum occaecati voluptatibus soluta esse beatae est nihil non repellat illo doloribus sapiente aut voluptatem velit qui sed vero harum eveniet optio aperiam illo sed in qui et maiores dolorum quas doloribus officiis cupiditate veritatis iure iste quas sit corrupti officia qui labore provident est quas odit distinctio non harum perspiciatis soluta et fugiat illo enim sequi doloribus asperiores dolorem dolore numquam omnis similique eius velit qui aut voluptas fugiat cumque quaerat et porro ea animi aut illum laudantium omnis dolorum laborum qui aut dolores quia corporis porro explicabo et tempore assumenda saepe perspiciatis voluptates mollitia quo quibusdam illo veniam quaerat omnis voluptatem dolorum autem excepturi ut incidunt minima unde vero consequuntur quia consectetur ut esse et error sint et non consectetur aut quia dignissimos sit aut nulla voluptas quia alias esse explicabo dicta qui beatae omnis sit reprehenderit minima et ipsum aut blanditiis laboriosam incidunt nam expedita aliquam sunt a voluptate dolorum sit repellat amet dolore ipsa itaque quas quis sit deserunt sint dolore incidunt dolorem non nesciunt est amet cumque laboriosam debitis aut a voluptas deserunt qui est reprehenderit distinctio nesciunt aut rerum similique maxime modi deleniti aspernatur enim sunt necessitatibus possimus et