INSERT INTO `course_news` VALUES ('798', '4', 'Tenetur reprehenderit excepturi magnam eaque.', 'Dolor sit magni doloribus nisi voluptatum eos quia fugit nihil neque veritatis autem cumque laboriosam corrupti qui non quas omnis blanditiis magnam porro aut architecto ipsa velit ab quia fugit autem perspiciatis similique reprehenderit dolore quos rem non consequatur vel saepe voluptatum aut vel et itaque alias et debitis hic eum velit enim fugit dolorem aut sunt libero ut vel ad aut animi eum sit nihil voluptatem ab labore corporis sint veniam ipsa consequatur harum quia omnis animi molestias voluptas est ut praesentium quo consequatur sunt est voluptatum libero qui voluptatem sit est quod omnis ut fuga minima minima minima incidunt earum eos perferendis sapiente quisquam aut quam quibusdam sit ad molestiae provident et reprehenderit quo ipsa voluptatem quisquam officiis quia rerum repellendus non harum quis quia facere et molestias qui deserunt et sed voluptatem magni consequatur et voluptatem ex sunt quaerat in quasi consequuntur nihil ut et consequatur quia similique distinctio delectus quia ipsa omnis perspiciatis autem dolorem dicta est ipsam non eius aperiam ea rerum distinctio consequatur hic quisquam nemo officiis distinctio nam in sint ab voluptas nihil quidem blanditiis nostrum aut vero aut eos cum voluptatibus quibusdam sint voluptatum est rem molestiae impedit similique rerum aperiam consequatur rem est illo perspiciatis dolor molestias hic et accusamus sit vel ea labore ipsam corporis quia similique dolores est neque voluptatibus autem rerum est est sint provident et quibusdam eius ad qui ut non dicta nesciunt atque id tempore ducimus illum dolore voluptas eum sapiente quis sit provident necessitatibus vitae ducimus qui et quo consectetur modi occaecati deserunt nulla id doloribus enim deserunt alias aliquam inventore autem qui cumque quia doloribus reprehenderit quaerat et quia odio ipsa amet dignissimos et at veniam quis dolore et illum officiis sit dolo