INSERT INTO `course_news` VALUES ('799', '7', 'Dicta est fuga est.', 'Odio ipsam quo quibusdam sunt ea cupiditate ad neque possimus voluptatum itaque ipsam nostrum et a doloremque laudantium quidem et itaque quod distinctio et magnam doloremque maiores dolor sequi amet ullam sit possimus qui placeat facilis ea magni omnis reprehenderit vel delectus odio quia beatae dolorem sint maiores est sint modi est suscipit et magnam hic earum nobis non quod sed tempore est totam ipsam nam earum iure ex inventore et commodi hic amet illum eum deleniti consequuntur suscipit minus rem molestias dignissimos aliquid non sed vel natus rem a voluptate et sed est odio inventore et dicta omnis quas voluptatem qui ad optio autem et fugiat dicta accusantium rerum nam sunt doloribus voluptatem iste omnis aut laborum saepe ratione ab harum repellendus dicta distinctio ut qui fugiat et maxime distinctio et reiciendis dignissimos explicabo et dignissimos tempora ut enim odit suscipit aut sed eveniet quaerat delectus fugiat perspiciatis eveniet nihil ut numquam consequatur voluptate provident aliquid eum minus optio explicabo repudiandae exercitationem ab est maiores earum ut doloremque non placeat eos enim minima error dolor modi non maxime alias veniam ratione corporis quod quas minima id ex optio et optio itaque saepe voluptas earum itaque ea quia amet rem omnis rerum nemo fuga iste corporis et iste omnis voluptatibus unde doloremque facere in accusamus non unde magnam necessitatibus repellendus cupiditate eum nostrum sed quibusdam vel quisquam labore eum voluptatem voluptate cumque quibusdam nobis necessitatibus quis id et amet non quia consequuntur non exercitationem eaque reiciendis officiis mollitia temporibus quisquam qui quisquam dolores inventore neque velit corporis ab enim officia sed est a eum non id aliquid reprehenderit voluptatem earum non facere laborum labore sed non iste odit est et explicabo quia et velit tempore aut et dolor beatae sit vel praesentium sit aut omnis possim