INSERT INTO `course_news` VALUES ('800', '8', 'Facere dolorum et distinctio dolorem ea ratione.', 'Repellendus est sit unde fuga saepe qui animi recusandae odit perspiciatis temporibus nam voluptas corrupti perferendis blanditiis aspernatur et maiores qui qui est ad non qui molestias molestiae ullam et molestiae et et ullam eum quasi placeat impedit aut quo qui dolorum aut eos sunt possimus eligendi vel aliquid minima qui atque et laborum laudantium non commodi fugiat et laboriosam atque quam atque aut corrupti rem laborum et enim similique maxime qui quos voluptatibus deleniti aut ab et amet accusamus amet nisi omnis perspiciatis ea occaecati autem eos dolorem excepturi reiciendis aut et quia est sit aut voluptatum eum quos recusandae commodi harum quas voluptate minima adipisci pariatur rem illum in nisi exercitationem qui non ab voluptas perferendis molestias quod omnis rerum illum est sed voluptatem est voluptatem autem aut et labore eligendi nostrum dicta molestias sit et velit dolor maxime ullam eos veritatis perspiciatis autem voluptatem esse quas non et fugiat magnam repellat consequuntur est suscipit necessitatibus quis dolorem eos animi consectetur magnam perferendis dolor nemo velit facere quidem eligendi incidunt numquam totam provident ab laudantium sunt consequatur velit enim expedita consequatur distinctio eum et necessitatibus asperiores asperiores quae sed fugit esse similique similique eum porro sit optio dolorem aut et dicta error sit eius blanditiis alias amet eum debitis repudiandae laboriosam ut animi voluptas assumenda iusto voluptates aliquid unde ea id asperiores eos et illo quo iure debitis voluptas est earum optio illo et est explicabo.', '0', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('801', '3', 'Vero aperiam et quia delectus.', 'Minus quia exercitationem qui cupiditate totam et ut doloribus autem soluta voluptas ut consequuntur inventore laborum nam voluptatem necessitatibus sit deserunt tempora ut voluptas sit officia aut corporis magnam adipisci et culpa est sit praesentium recusandae at et laboriosam unde dolor voluptas fugit quia omnis distinctio possimus doloribus amet animi ut sit tenetur aut quod voluptates maiores est illo veritatis possimus ex at consequatur et sit a fugit voluptas rerum et ut numquam culpa distinctio dolorem deserunt eos quod sint labore incidunt enim asperiores recusandae consectetur voluptatem ut perspiciatis ut in cumque voluptatem quia qui perspiciatis fugit mollitia incidunt ea deserunt eius ut ut quos omnis aut numquam magnam nihil ipsa aut debitis quia quia modi tempore quia ducimus impedit fugiat aspernatur quibusdam nihil qui qui ut numquam et corporis qui nihil consequatur provident totam nihil corrupti sequi accusamus aliquid ea necessitatibus doloribus culpa corrupti dolore architecto dolor et doloribus ullam fugiat nulla maxime ut distinctio repudiandae provident asperiores sint maiores blanditiis aliquid ut dolores dicta et sed voluptate illum reprehenderit at fugit quam saepe facere alias delectus voluptatem eos ea expedita earum eligendi qui suscipit aut aut voluptatem officia omnis iure nihil at repudiandae qui velit dolor dolore accusamus quasi fugit culpa aut molestiae consequatur ut distinctio quasi sequi aliquid ipsa eius sapiente esse rem necessitatibus.', '1', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('802', '8', 'Vero tempora nemo explicabo aliquam magnam voluptas voluptatem.', 'Libero enim quas est sit voluptatem exercitationem sed ducimus est velit officiis et vitae ea nobis dolore esse quisquam quo dolorum tenetur quam sunt eos non est similique qui hic soluta dolores ad rerum iusto eos voluptatem cum et porro aperiam dolore et qui excepturi aut velit animi itaque voluptatem qui impedit eaque amet similique autem a est maiores ut ipsam officiis sint reprehenderit atque maiores reiciendis ratione itaque unde natus rerum id et delectus velit impedit unde qui ipsa error assumenda unde asperiores cumque suscipit explicabo perferendis aspernatur atque aut vero veniam ratione magni est dolorem facilis non recusandae vero aliquam eum repudiandae suscipit explicabo molestias vel amet et voluptate error praesentium architecto laboriosam totam possimus est reiciendis qui labore modi debitis voluptates illo quas dolor enim natus quas aut est est accusantium esse tempore ut dignissimos voluptas ut blanditiis perferendis magnam sit eos est aliquam enim dolorem et et atque consequatur ullam qui ex molestiae nesciunt illo voluptatem dolores qui provident soluta dolores reprehenderit fuga et rerum minima unde delectus omnis quia voluptatibus velit commodi voluptas animi eos est aut ea dolorum quibusdam in sunt dolores vero autem autem veniam perspiciatis animi eligendi nostrum ea inventore sit fuga tenetur sapiente ad officiis et.', '0', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('803', '7', 'Totam maxime odit perferendis.', 'Velit ratione sit impedit ipsam maxime eum nesciunt sit earum quo deleniti molestias odio occaecati odio consectetur et sunt qui veritatis magni officiis consectetur quis accusantium iusto fugiat expedita quos ut fugit unde numquam aut aut sit dolorem iure explicabo rerum impedit temporibus qui deleniti quisquam aut ea voluptates beatae vitae inventore ut eos necessitatibus cumque recusandae maxime ut et inventore et sit ad laboriosam qui ipsa dicta iure numquam quod in dolor itaque alias quod velit doloremque modi sed eius at voluptas molestiae aut itaque consequatur aut ut sapiente quam qui velit magni impedit voluptatem illum voluptate consequuntur odit non dolore minus nemo dolorem et nesciunt voluptas adipisci non asperiores et quasi sed officiis est rem qui dolorum assumenda repellat quo ratione possimus ratione velit ullam et voluptate natus est amet possimus laborum laborum sint reprehenderit soluta soluta velit tenetur quia ut cupiditate voluptatem dolorem eos et voluptatibus aut incidunt quibusdam quo sit quaerat et velit suscipit in exercitationem similique qui in quia accusantium sed nesciunt quia deleniti fuga omnis eos non perferendis minima quasi voluptatum qui non voluptates quia quia rerum quae labore est consequatur voluptatem deserunt similique culpa qui laboriosam perspiciatis qui et.', '1', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('804', '1', 'Adipisci culpa accusantium sint autem beatae veniam dicta et.', 'Aut voluptates eos excepturi ut consequuntur eius modi error qui dolorem doloremque aut eius beatae porro animi veritatis aperiam aut pariatur reprehenderit minus autem nostrum voluptas expedita omnis alias nisi odit est dolores quam nihil pariatur accusantium est cupiditate dolorum at aperiam omnis et sit maiores et a quo quisquam deleniti laboriosam nobis perspiciatis sint aut quia vero est adipisci vero quos ipsum explicabo voluptas unde debitis aut est consectetur neque omnis porro enim quasi praesentium impedit nesciunt eos et distinctio suscipit eum occaecati quibusdam sunt sed sit repellat sit et commodi aut accusantium aut occaecati veniam error commodi esse iste possimus praesentium rerum et distinctio voluptas consectetur earum quasi voluptatem itaque aut labore sit fuga incidunt itaque magnam voluptate deleniti natus a atque consequuntur accusamus nam qui distinctio assumenda repudiandae at harum ipsa nostrum doloremque quo ut nostrum et eos in incidunt laborum accusamus sit dolores et consequatur et est saepe et et sed delectus explicabo provident cupiditate sint quae perferendis quia ab modi error repellendus magni quos non aperiam id voluptatum error aut a consequatur qui rerum libero unde quia in consequatur illum dignissimos voluptas voluptas optio et et voluptatem numquam ut accusantium aliquam asperiores explicabo aut libero ipsa nostrum aspernatur quae ut ipsum repudiandae natus ut assumenda non dolorem nemo omnis dolorum nostrum odio natus pariatur nobis et laborum inventore odio delectus id.', '1', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('805', '10', 'Delectus est est doloribus quasi quia est excepturi.', 'Nihil consequuntur quo ea voluptate non corporis alias maxime quis voluptatem nobis in minus est aut dolore alias qui neque ut placeat et et ab illum aut excepturi mollitia qui temporibus numquam a vitae ea id praesentium ut aliquam quis dolorem laudantium optio sit ut nihil aliquam explicabo provident sit aut saepe rem pariatur nesciunt accusantium aut facilis et est recusandae amet provident inventore maiores voluptatem error excepturi quibusdam numquam ut vero quia repellendus molestias labore aspernatur perferendis est dolor voluptatem quia recusandae veniam expedita sint modi in perferendis aut nemo reprehenderit omnis aliquam et mollitia nobis et recusandae amet cum ullam non nisi quia ullam et similique vero excepturi nulla id sunt nihil accusamus id culpa eum odio quam ipsum non dolores ut voluptatibus voluptatem sapiente asperiores deleniti inventore sed sed id est vero voluptatem et recusandae mollitia dignissimos eos debitis facere assumenda reprehenderit cum exercitationem accusamus est ut blanditiis placeat ut blanditiis reprehenderit voluptatem omnis alias fugit ipsa illo facilis ut id dicta est quia aut dolorum deserunt adipisci omnis eos enim voluptatem sunt delectus atque ut consequatur ipsa ipsam molestiae exercitationem assumenda enim accusantium labore modi odio.', '0', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
INSERT INTO `course_news` VALUES ('806', '5', 'Cupiditate repellendus cumque placeat numquam provident omnis.', 'Consequuntur sapiente dolorum occaecati aut voluptatem occaecati quidem exercitationem quia distinctio mollitia quia molestiae magnam neque totam quidem mollitia aut corrupti rerum saepe qui veniam quo rerum odit libero eveniet quo animi quo natus quis quis architecto quidem officiis repellat dicta dolor esse doloremque vero et temporibus quisquam iusto inventore laboriosam nisi sunt earum harum explicabo aut iste est et dolores aut deserunt quis voluptatem sunt sit beatae et commodi inventore soluta hic eligendi nihil a iure sed eum delectus fuga non voluptas aliquid exercitationem quaerat voluptates ex et quo voluptates voluptatem eveniet cum sint necessitatibus hic est ad ea magni voluptatem natus libero quisquam alias omnis fuga quia possimus reprehenderit officiis ut voluptas sequi similique molestias omnis sed quibusdam consequatur sed a aliquid illo voluptates ut numquam nulla beatae et laudantium id voluptatibus voluptates enim ut velit omnis nemo commodi odit voluptates voluptatem cumque aut minima quisquam minima autem sunt voluptatem nobis autem doloremque aperiam vero quas voluptatum rerum in laboriosam enim officia mollitia voluptas et maiores modi dolore totam eum omnis expedita dolor beatae sed omnis aut officia inventore consequatur ut et est asperiores dolores laborum tenetur quam nulla deserunt doloribus dolore dignissimos perferendis ab similique quia placeat repellat provident deserunt a enim iusto eius aut cupiditate laudantium accusantium repudiandae accusantium quam voluptatibus sed placeat repellendus fugit commodi accusantium a praesentium non repellat amet sit mollitia iusto a sed cum voluptatibus repellendus aspernatur et tenetur velit dolorum perspiciatis et aut ad esse distinctio doloremque aperiam quod ipsam neque eveniet molestiae sapiente amet qui rem nam eaque minus nisi rerum deleniti et et iste similique dolor ea ut quo 