INSERT INTO `course_news` VALUES ('807', '9', 'Fugit tenetur est eligendi.', 'Illum autem est praesentium asperiores nobis et pariatur deleniti aperiam nobis nihil ullam in sed rerum autem officia modi recusandae illo nemo ad nostrum similique sit ad sed est nulla vero saepe dolorem vel est totam ut aut dolorem praesentium aliquid vitae non inventore dolores ipsa cumque ut est dicta ducimus explicabo occaecati voluptas eos ut in dolor veniam voluptate cumque aliquid cumque dolor est maxime consequuntur ut dolores accusantium dolores necessitatibus et unde illo aliquam odio voluptas ipsa magnam impedit rem accusantium tempore enim est nihil voluptatum omnis consequuntur optio quis consequuntur labore a et ut eum et nostrum alias excepturi facilis porro et modi aut ratione velit nemo beatae quia dolorem et aut qui perferendis enim qui laudantium harum qui perferendis et eum quis impedit quia eligendi laborum dolorem ullam architecto atque deleniti optio dolorem quo enim quidem ex omnis ut quos incidunt error dolorum quaerat ducimus quisquam voluptas quas adipisci repudiandae et rerum quod doloribus dignissimos culpa odio saepe quia occaecati fugit dignissimos ut illum laudantium aut delectus suscipit placeat vero rerum possimus adipisci dolores eaque occaecati laborum illum eaque sed voluptas rerum inventore illo rerum sit modi numquam eum dolorum qui non esse sed suscipit libero omnis rerum est quas nam voluptates voluptatem adipisci ea commodi a veniam voluptatem dolorem ab provident voluptas eveniet temporibus rerum et laudantium sed excepturi sit ut veritatis inventore nesciunt suscipit quas quos aliquam non non qui esse quas inventore consequatur explicabo quo modi labore omnis voluptatem sunt qui est et fugit maxime et nam eligendi blanditiis facere enim excepturi molestiae aut eum culpa et quas culpa reiciendis qui.', '1', '2017-05-02 22:59:31', '2017-05-02 22:59:31');
