INSERT INTO `course_news` VALUES ('812', '4', 'Reiciendis suscipit rerum quia et.', 'Quia molestiae sint ea quas ex dolor praesentium reiciendis voluptatem quia quos provident nihil incidunt repudiandae ex praesentium eos veritatis nam provident harum facere eligendi culpa in eligendi asperiores neque sit sunt labore voluptatem quas perspiciatis totam ut dolores impedit provident excepturi quia et voluptatem asperiores sunt sint culpa repellat exercitationem placeat ut voluptas iure officia enim facere nulla atque ullam nulla rem ad expedita voluptatem praesentium atque omnis deserunt sit quia quibusdam sed necessitatibus quis officia qui culpa aliquam nam fugiat facere velit neque sequi nisi sed culpa quia corrupti et laborum enim id aut est dolor a magni sunt qui qui at maxime eveniet est sequi mollitia omnis libero eos molestiae eos molestiae et consectetur culpa quia rerum soluta illum enim laboriosam minima exercitationem rem dicta quod tempore qui architecto quos ducimus officiis qui inventore cupiditate quisquam nihil est at praesentium aut alias distinctio odit facere qui vitae animi dolore aut ipsam blanditiis adipisci quia rerum itaque non perspiciatis est velit doloribus nisi maxime rerum accusamus aliquam qui dolorem quis laborum repellat ipsum in perferendis eum occaecati illum inventore sequi porro saepe saepe et facilis omnis quam ipsa nihil est amet voluptatem fuga nihil dolor ut est sit quia voluptas qui perspiciatis ea dignissimos est esse ut adipisci minus aut corrupti optio delectus ipsum repellendus laudantium dolores necessitatibus maiores et iste id corrupti consequatur quia doloribus autem ea est ex consequatur blanditiis quos praesentium aut minus accusamus ab dolor eligendi explicabo veritatis distinctio sapiente veniam vel voluptatem cupiditate quia ab est neque ipsa aliquam quaerat rerum nesciunt cumque eum labore veritatis omnis blanditiis ab et quis nulla laborum soluta voluptate labore dolorem.', '1', '2017-05-02 22:59:32', '2017-05-02