INSERT INTO `course_news` VALUES ('813', '8', 'Quo ratione quos omnis ut.', 'Exercitationem et in non dolore cupiditate quis reiciendis laborum labore et adipisci sit quisquam ut id explicabo a asperiores perferendis et consequatur quidem optio sint mollitia voluptatum beatae omnis est dignissimos dolorum fugit dolor iste sint aut accusantium repudiandae omnis delectus accusamus laboriosam accusamus voluptatum expedita occaecati libero distinctio officiis veniam omnis accusantium laudantium qui accusantium laudantium consequuntur deleniti dignissimos quis quibusdam eius nulla reiciendis in id perferendis eligendi eum id sint maiores est quia beatae sapiente et sunt rerum hic itaque eius non architecto rem repellendus a asperiores vel ipsam id commodi fugit repellat odio quidem et rerum autem ullam quia voluptatem perspiciatis illo id voluptas repellendus omnis aut aut laborum cupiditate minus vel veritatis voluptate omnis eligendi eum laudantium beatae reiciendis et in dolorem laborum perferendis sint eos ducimus impedit eos enim temporibus repudiandae molestias esse voluptatem alias aspernatur voluptates ex aut sed blanditiis enim non ut quos omnis in ab qui dolorum omnis sint eum ut voluptates mollitia et unde ipsum velit sit consequatur ipsa consequuntur assumenda earum consequuntur dolores dolorem magnam nobis assumenda odit iure nisi magni consequatur nam consectetur possimus corporis excepturi quia ea consectetur ad nam odio temporibus quibusdam non est dolores nam eius officiis quos et quo dolor totam velit hic ipsa eos dolorem magnam officia ut qui est deserunt.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('814', '8', 'Quam qui perferendis nihil sunt.', 'Accusantium et impedit autem repellat assumenda excepturi sunt occaecati amet distinctio ut sint odio aut velit asperiores aliquam inventore sint quidem in laudantium ut rerum omnis et sit reprehenderit dolorem omnis officiis sit voluptas eos quo accusantium voluptatibus numquam at incidunt neque porro repellat ut itaque quasi dolorum quo ut quos magnam et vel mollitia consectetur nobis occaecati nihil amet facere repudiandae reprehenderit veritatis placeat iste recusandae itaque voluptatum cumque assumenda sit vitae quia voluptas similique nesciunt pariatur rerum nostrum quos et perspiciatis laborum voluptatum soluta vel accusamus perspiciatis ipsum eos nam commodi eius ab eum eos facere et mollitia rerum aut recusandae voluptas est iure cum magnam tempore nulla voluptatem labore error iure aut porro ullam quam non temporibus enim libero fugiat eum autem id iusto ducimus corporis corporis et illo voluptatem non nisi rerum expedita quo fuga et qui ratione consequatur sunt illum nihil sequi unde eaque pariatur beatae inventore maiores voluptates placeat esse velit voluptatem facere ipsa aspernatur dolores consequatur et perspiciatis praesentium rerum ab reiciendis ab est reprehenderit minus culpa est ea earum voluptatem molestiae ducimus est accusantium et qui aut in commodi vitae maxime ut est cum vel sint dolores eligendi aut ipsa aliquam rerum distinctio amet veniam voluptas blanditiis.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('815', '7', 'Sequi in quos rerum est voluptatibus perspiciatis.', 'Adipisci provident labore quidem molestias eos aut rem id laudantium aut deserunt voluptatibus fuga sapiente maiores velit sint voluptas omnis at doloremque aperiam laboriosam quis nostrum sunt libero unde minima beatae consectetur repellendus error aut iste id provident alias omnis voluptatem quia alias temporibus similique possimus est autem et ratione aperiam labore voluptas et in vel nobis voluptatem voluptas possimus nam molestiae voluptas et qui voluptate velit quae voluptatum distinctio aspernatur voluptas quo nemo illo esse beatae dolor est voluptate id nihil sit est voluptatem necessitatibus impedit eum architecto sit in qui qui beatae eos eos atque suscipit veniam est aliquam veniam ut nulla assumenda dignissimos dolorum distinctio iste aut corporis quos et ut omnis aliquid est minima consequatur nihil aut rerum cumque dolorem voluptatem est ullam reiciendis nulla ut omnis ipsum dolor velit consectetur molestiae quis sequi possimus ad iste praesentium et velit aliquid commodi voluptates eos repellendus modi omnis vero corrupti suscipit voluptate inventore ut culpa debitis omnis repudiandae quam omnis cum vitae placeat rerum itaque saepe delectus velit autem sed omnis similique impedit quis sed autem facilis repellendus reiciendis ut velit consequatur ut veritatis similique delectus et laborum facere minus mollitia illo suscipit qui laudantium at doloremque voluptas illo incidunt maxime nisi eos aliquid repellat amet aut odit assumenda consequatur occaecati quo et consequatur similique voluptatem sapiente nisi rerum molestiae repellendus perferendis maiores necessitatibus et delectus veritatis qui nulla.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('816', '5', 'Ea quas voluptatem omnis earum qui et.', 'Non velit dolor occaecati placeat magni omnis similique dignissimos placeat repellat cumque qui ut eos repellat voluptatum omnis eum iure ad repellendus velit ab dicta et blanditiis repellat ut officia ducimus totam eos nihil ipsa quas tenetur aspernatur quidem commodi assumenda deleniti delectus eos et similique facilis quibusdam ut nihil nisi explicabo sequi consequatur aut consequatur sed aperiam quia enim ad nisi aliquid nisi et perferendis laborum voluptatibus in vel ea atque et deserunt sit molestias mollitia sapiente officiis voluptatem fugiat iure voluptatem tempore fugiat quo minima aperiam nihil magnam vitae voluptatum distinctio quas eaque in dolorum quod expedita quaerat molestiae quaerat ducimus dolorem vel dolorum modi provident et ab in beatae et dolorem quis et nihil dolore unde consequatur deserunt nobis nulla aliquam adipisci nihil consectetur ipsa fugiat est odit itaque dolores rerum deserunt eveniet est quo earum labore saepe aut nihil et facilis voluptas non ut magnam animi quasi beatae esse vel provident repellat ipsam porro corporis architecto et sed omnis ut error modi excepturi sed qui illum iusto aspernatur dicta qui nulla aut quas reprehenderit ut eligendi dolore assumenda aut sit et ea quis ut numquam et magni blanditiis ullam aut doloribus aut provident voluptatem eos consequatur et necessitatibus perspiciatis delectus culpa beatae aliquid perferendis excepturi cum fugiat saepe consequatur laudantium est quia blanditiis corrupti autem incidunt at ut et similique veniam similique sint itaque distinctio et sint non qui eligendi velit et voluptatum reprehenderit vel ipsam sed aperiam omnis labore eos voluptatum et illum consectetur itaque.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('817', '4', 'Reiciendis dolor qui velit tempore.', 'Facilis a autem molestias quo dolorum commodi blanditiis officiis eos nihil architecto inventore dolor quis fuga minima eaque libero in officia et non omnis consequatur quasi omnis aspernatur necessitatibus odio est nulla aut totam ea voluptatem enim ipsum vitae mollitia tempore sed nam reiciendis at voluptatum debitis est est optio aut laudantium soluta est aut aliquam quis deleniti eius necessitatibus aspernatur aperiam inventore laborum incidunt totam voluptatibus provident est atque accusamus neque tenetur ut non tempore quae soluta sequi atque laboriosam voluptate adipisci atque eos excepturi nulla quidem corporis doloribus sit corporis laudantium vel voluptas iusto ut harum distinctio dicta ipsa reprehenderit nihil voluptas deleniti excepturi dolore inventore delectus dolor consequuntur sequi consequuntur quis earum pariatur et omnis rerum laboriosam atque repudiandae qui vitae vero perferendis officiis laboriosam repellendus aut et consequatur dolore ea in harum eos consequatur autem voluptatum itaque dolores suscipit aut ut est officia ratione omnis quia cumque consequatur autem saepe quia accusamus dolore tempore ipsa fugiat pariatur vitae voluptas quis ullam tempora hic tenetur aut error maxime eaque excepturi assumenda et nemo reprehenderit facere quisquam eveniet quos est quod dolore voluptate aperiam cupiditate quas omnis quibusdam et a deleniti vel itaque minus labore dolor recusandae et eos alias et veritatis est neque quae quisquam voluptates asperiores qui consequuntur nobis dolor est blanditiis non saepe voluptas aperiam consectetur enim aspernatur voluptatum praesentium dolor ipsum perferendis et nam nobis quo eveniet dolores est maxime est veniam.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('818', '6', 'Labore possimus quam quod eum omnis repellat facere ipsum.', 'Quidem qui temporibus repellendus esse tempore hic saepe cupiditate blanditiis ex ipsum aliquam ut molestiae quis quisquam at accusantium laboriosam vero consequatur et ut error culpa et praesentium id ut perspiciatis illo qui voluptas quam et ipsam corrupti nihil omnis sed quia explicabo suscipit quia aut ad recusandae et dolorem voluptas amet aut dolorem distinctio sit est autem distinctio deleniti neque asperiores ut deserunt porro rerum eveniet ea cupiditate est veniam odio soluta eos possimus qui quasi quos aut laborum maiores quibusdam facere rerum impedit ipsam voluptas rerum laudantium in ut et et rerum voluptatem qui repellendus similique voluptates non qui dolorem assumenda rem delectus id ad explicabo corrupti laudantium quaerat consequuntur repellat laboriosam assumenda sed optio et adipisci neque eos quo a molestiae totam excepturi non autem illo ipsa culpa laboriosam consequatur aut tempore animi aliquid harum est est fuga ullam ex nihil est cum voluptas neque aut optio quos vero sapiente omnis dolor eum voluptatem laudantium consequatur sint asperiores voluptas atque et impedit et error et voluptatem asperiores est molestiae debitis omnis cum fuga voluptas debitis numquam quia dolorem ut sunt qui quo qui ratione odit ratione ea sapiente fugit sunt veniam nisi delectus corrupti ut numquam laudantium qui impedit suscipit dolorem commodi quis in facilis voluptas aliquam sit quis expedita qui sint rem eveniet ut perspiciatis magnam repellat harum totam quas doloremque quibusdam vel quas ut rerum fugit aut autem sapiente corrupti ea voluptatem a praesentium quas corrupti aut eos fugiat est ad molestiae culpa consequatur alias deleniti eaque quod qui ducimus ut esse doloribus atque consectetur voluptatibus perferendis voluptatem est ea laborum in totam excepturi enim omnis minus laborum consectetur officia voluptatum et dolorem illo tempore.', '1', '