INSERT INTO `course_news` VALUES ('819', '6', 'Assumenda et velit ipsam commodi qui id eaque.', 'Sunt nobis natus porro sint dolorem repellendus magnam et aspernatur molestiae odio magni accusamus a eum reprehenderit repellendus aperiam et quidem dignissimos quibusdam aut eaque rem suscipit quia accusamus at voluptatem blanditiis autem accusantium ut recusandae sit eveniet qui placeat voluptate rem soluta aut ut qui cumque id nulla aspernatur id pariatur laboriosam repellat voluptatem nemo et corporis est incidunt tempora ut magnam corporis accusantium et ea molestiae suscipit sunt et ut vel vitae voluptates quas quaerat dignissimos neque quod rerum quisquam perferendis molestias facilis dolorum accusamus praesentium non natus veniam aut dicta voluptatibus vel exercitationem reprehenderit aliquam debitis nemo perspiciatis sequi neque pariatur excepturi quisquam aut iste hic accusamus magnam neque voluptatem esse sit esse non provident sed ipsum provident qui enim sint non ratione eveniet nesciunt voluptas voluptas sunt error molestiae amet et quas rerum tenetur quisquam nihil totam perspiciatis rem dolor et est in incidunt voluptatibus aliquam quae molestias qui et quasi ab aliquid deserunt qui quam aut voluptas ad sit pariatur veniam veritatis nisi ut numquam quasi saepe omnis est porro sed sit et omnis et unde et dicta est et id deserunt illum deleniti quae labore nostrum ea est temporibus sed repellendus ea quia assumenda tempore doloribus occaecati sapiente voluptas recusandae sed aut in beatae qui harum voluptas sequi enim asperiores minima est temporibus reprehenderit autem impedit cumque quod harum sunt est tempora sunt et praesentium occaecati ut repudiandae reprehenderit perferendis sed id sapiente ut repudiandae.', '0', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('820', '1', 'Doloremque occaecati ratione repudiandae eos ea molestiae.', 'Velit dignissimos modi adipisci doloribus aut at culpa voluptate molestiae pariatur et et aut velit quidem nemo deserunt vel voluptatibus in ratione et provident dolor beatae fugiat fugiat porro dolorum et consequuntur unde rem aut blanditiis nostrum vitae dignissimos molestias a ex ab reprehenderit adipisci debitis possimus velit suscipit illo quae odit molestiae sit enim in voluptatum voluptatem qui temporibus et facilis laudantium nesciunt pariatur voluptas aliquam qui in et alias quam quia atque sit in aut nam laborum autem cupiditate quia dolor quia rerum voluptas rerum perspiciatis debitis provident doloribus sint cupiditate odio voluptatem distinctio minus blanditiis in minima ea eius maxime reprehenderit quidem sint quia inventore impedit quia nesciunt eos officia nostrum quaerat rerum dolores recusandae incidunt ducimus et corrupti qui optio autem quisquam aut facilis facere et voluptatem veritatis odio et hic in ratione ducimus culpa dolorem ut et labore enim temporibus accusantium et vel et perspiciatis commodi deleniti eligendi maiores eius eum possimus rerum voluptatem maiores ut qui saepe cupiditate fugit et eaque voluptatem nobis unde sed enim aperiam illum laudantium voluptas esse tempora rerum ad sed distinctio perferendis id a quaerat ut dolor libero enim ut nemo dolorem soluta sed quia vitae perspiciatis qui adipisci ipsam eius repudiandae a ut provident ut eius earum minus ipsum sed enim sit quia hic tempora consectetur voluptatum consequatur modi excepturi aliquid nobis minus est tempore ut laudantium voluptatem neque praesentium vitae expedita ratione quidem velit odit accusamus non itaque ipsum beatae quidem maiores consectetur et consequatur recusandae velit quia perferendis debitis inventore nam sit delectus cum sint est omnis perferendis cupiditate laborum vero sed similique aut quae aut iusto eligendi neque qui aut error expedita ut