INSERT INTO `course_news` VALUES ('821', '4', 'Maiores voluptas at quidem fugiat.', 'Qui asperiores possimus numquam qui voluptates laboriosam sunt laudantium quos minus ullam corporis ratione sit placeat ullam harum velit dignissimos voluptas qui doloremque eius quos illum sed tempora sint tempora veritatis beatae error ipsum ab libero quia non laborum nam ad repellendus non a aut omnis similique ex sed aliquam ut in tempore consequatur blanditiis incidunt expedita nam officiis ipsum et et ullam explicabo sunt aut vero consequatur et voluptatem non eligendi odio sed et molestiae quisquam minima dolores minus maiores eos cupiditate libero at recusandae quam dicta dignissimos cupiditate corporis numquam nesciunt aut consectetur voluptates magni totam ut ut illum cum explicabo dolore voluptates soluta et amet similique maiores architecto veritatis quis dolores necessitatibus quia impedit vel et quia mollitia qui eius ut nisi et quae consequatur voluptas aliquid ea perspiciatis voluptatem dignissimos saepe non id dolore dignissimos et consectetur quasi sequi corrupti velit voluptatem culpa neque qui corporis non et dolores sed quasi repudiandae est illo quibusdam ea at aliquid porro aut consectetur ea vel aut quibusdam ab qui doloribus sed nemo iure qui nihil eaque voluptatem consequatur est non provident et voluptatem tempora vel earum odit ratione odio rem similique dolores quidem fugiat quo at molestiae et quis ducimus vero dolores tempora ex repellat quis sint incidunt qui rerum dignissimos quasi aliquam odit excepturi voluptate doloribus cupiditate porro aut voluptate nisi repellendus quam et quo incidunt autem explicabo nostrum officia soluta rerum iste placeat culpa illum quia iure et eum ratione qui enim veritatis quibusdam numquam facilis maxime aspernatur voluptatem doloribus quibusdam hic molestiae magnam voluptas cum autem qui nihil praesentium nihil aut ea laboriosam dolorem sequi deserunt ipsa sed et tenetur ut voluptatem vero asperiores voluptatum alias et dolor dolor odio fugiat odio eos rerum corporis est ipsum optio nobis aliquid doloribus maiores odio accusantium inventore quis itaque aspernatur voluptatem omnis eos nihil saepe cupiditate itaque voluptas cum et illo nobis neque quis voluptatum accusantium voluptas vel dolores qui et vero exercitationem molestiae aut tempore vel itaque repellat cupiditate soluta alias nesciunt similique officiis voluptas est ab numquam asperiores.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('822', '8', 'Esse inventore laborum tempore voluptatem occaecati animi.', 'Reprehenderit corrupti atque dicta error et sunt esse itaque et modi et ad quo fugiat doloremque saepe quo nobis harum id dolorem voluptas error mollitia dolorum dolor culpa ab id facilis cumque voluptas qui quas explicabo nihil quia reiciendis qui rerum ut rerum occaecati vel vitae facilis aspernatur quia non ratione minima id eum ut quo amet sit rerum quis repellendus velit iure impedit soluta exercitationem non a quisquam saepe natus aut praesentium quae aliquid nesciunt ut nihil non aperiam velit animi voluptatem nihil voluptas voluptatibus vel odit quo sunt inventore aut vel aliquid et perspiciatis doloremque rerum sint aut saepe voluptatibus sed voluptatem enim voluptas voluptas a at doloremque rerum ex quam ab dolorum quis incidunt optio sit aut odit consequuntur dolores reiciendis ea dolorem ratione sunt voluptates veritatis officiis ut facilis suscipit alias accusamus enim et consequuntur quis laborum provident natus itaque doloremque eos blanditiis dolore est eum sed occaecati debitis voluptatem odit qui reiciendis expedita nostrum ea minima ut odio sapiente ipsam quas aut aut debitis non qui libero dolores non cupiditate voluptates quisquam qui nesciunt autem quam ipsa possimus pariatur maiores eveniet sed perferendis amet qui culpa qui et laborum sint odio dolorem ut aut amet error qui ut natus voluptates at velit occaecati at quidem sit beatae aliquid sed sint molestias et recusandae reprehenderit soluta ut eius quia beatae maiores at nihil eum qui eius et illo commodi quo saepe illo odit rerum quaerat ab repudiandae odit recusandae consectetur vero praesentium ad sit qui quod architecto rem distinctio nobis est autem sunt culpa est magnam est dignissimos debitis suscipit asperiores fugit nostrum quaerat hic harum et id nostrum similique nesciunt et ducimus aliquam itaque non voluptas qui facere incidunt ab quidem quisquam et error voluptates dolores numquam voluptatem ut ea totam ut animi mollitia animi ab et dolor dolores molestiae iste tempore aperiam asperiores ullam ab eligendi molestiae earum tenetur facilis.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('823', '8', 'Dolorum consequatur vel culpa facilis dignissimos maxime illo.', 'Et magnam voluptatibus sequi odit quidem autem ad facere voluptatum itaque nulla necessitatibus quos officiis similique nesciunt eveniet voluptas nemo reprehenderit molestiae inventore libero tempore alias autem sunt enim nisi consequuntur qui quos ea assumenda esse minima aut veritatis aut voluptatem voluptatum voluptatem rerum iste et asperiores veritatis voluptas corporis quod saepe ipsa aut qui voluptatibus quaerat consequatur voluptas reprehenderit consectetur mollitia reiciendis numquam libero quod quas et sit doloribus temporibus maxime facilis et ut neque qui itaque nam odio voluptates asperiores modi illum dolorem et ipsum eligendi saepe in omnis impedit expedita minima ipsa nostrum voluptatem aut quia occaecati eos qui ut omnis dolorum ut nostrum autem est sed rerum dolorem sed omnis eligendi velit quos aliquam temporibus animi occaecati inventore optio omnis voluptatem illum quia iusto est et culpa magnam quia a perferendis ipsa magnam dignissimos voluptas inventore reprehenderit omnis id nihil voluptatum expedita perspiciatis ea necessitatibus sed temporibus hic architecto aut quam eaque quaerat labore corrupti consequatur ducimus quaerat cum error ipsa mollitia vitae labore quisquam repellendus et dolores eveniet tempore rerum voluptates in enim quis debitis voluptatibus ab id veritatis pariatur reprehenderit eveniet consectetur est similique ducimus pariatur dolor hic sunt tenetur aut quod nulla qui expedita a eius qui voluptatem nihil optio dolores itaque aliquid aperiam ut totam distinctio saepe maxime repellendus doloremque vero fugiat.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('824', '2', 'Explicabo atque delectus id in aliquid quia quas quis.', 'Laborum repellat itaque veniam est perferendis nisi explicabo consequatur est voluptates sunt et voluptas illum odit est molestiae nihil dolor ab illum est ea assumenda adipisci illo reprehenderit dicta laudantium dolores sit quia rerum voluptatum qui minus illum vel rerum quo eaque dolor qui aliquam dolorem omnis et qui rerum laboriosam voluptatem et dolorem repellat placeat optio id consequuntur molestias vel maxime non laudantium qui odio eum modi saepe similique a hic iure possimus inventore quidem maxime quia ut et perferendis dolorem est perferendis ipsa minus iusto nostrum sed autem sed sed amet sequi placeat molestiae minus voluptate aut ea vero maiores inventore ipsum consequatur nemo aut ullam et sed tempore mollitia sapiente pariatur iste assumenda qui provident corporis qui quis consequatur libero quidem saepe cum commodi sit occaecati voluptatem nemo a occaecati modi temporibus repellat maiores aut aliquid dicta qui illo earum molestias eum reprehenderit sapiente a deserunt aliquam et commodi optio tempora qui et est nisi quia delectus debitis voluptatem occaecati repellat velit ut beatae neque rem ducimus assumenda ab molestiae voluptate sint necessitatibus sit et assumenda nulla aperiam molestiae aspernatur quia praesentium totam et eum et temporibus minima tempora autem aut omnis nulla itaque fugiat consequatur enim quia consequatur minus necessitatibus repudiandae et saepe molestiae magnam quod sequi.', '0', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('825', '2', 'Distinctio et consequatur natus voluptate laudantium.', 'Eum qui officiis ut explicabo accusamus quia qui quam voluptatem eum consequuntur accusantium unde dolorem veritatis ipsa aut cumque repudiandae dicta aperiam est nulla necessitatibus sed reiciendis labore aut fugit provident ipsa non tempora quis excepturi dolores dolorem qui aut magnam vel rerum vitae deleniti modi ea autem ut ad eos rerum saepe error asperiores voluptatem veritatis laborum est minus iure est voluptate aut placeat dolorum in quas animi amet maiores commodi ad repudiandae beatae accusamus non accusantium voluptas est a sit distinctio tempora id natus vitae recusandae quia placeat qui qui aperiam sint dolorem non quos laudantium quia ex repellendus beatae consequuntur totam nisi dolor veniam suscipit vitae deleniti quis dolor nihil consequatur ad impedit dolor deleniti nihil rerum est et ex id odit vel molestiae et non voluptas qui deleniti sit et voluptatem soluta omnis omnis molestiae debitis magnam aut et tempora itaque quidem cum vero eveniet quasi sit hic fugiat vel rem in cumque optio ad laborum sit velit labore id perferendis accusantium qui tempore cum ipsam aut aut at doloremque voluptatem qui aut sit asperiores eos itaque molestiae perspiciatis ex eligendi earum dolore quia consequatur eaque molestiae rerum qui est sed aut quis voluptate natus omnis et natus quia necessitatibus corporis voluptatibus nesciunt maiores quia minus aliquam sint officia voluptatem ex occaecati aut iste doloribus delectus sed voluptates ut non autem porro quis praesentium omnis voluptatem quaerat cumque eaque officia quidem.', '1', '2017-05-02 22:59:32', '2017-05-02 22:59:32');
INSERT INTO `course_news` VALUES ('826', '4', 'Quisquam voluptas corrupti id aliquid consequatur deserunt et nihil.', 'Voluptatem cum consequatur veniam rem porro dolore error consequatur ad unde officia iusto quos aut delectus perferendis qui sit quisquam excepturi deserunt eaque nihil quibusdam aliquam aut error odit voluptate numquam asperiores dolorem non fugiat ut molestias aut molestiae impedit provident atque et quisquam voluptate rerum exercitationem sed earum nobis illum laboriosam velit ut quas consequatur atque provident aut sit voluptatem similique et sunt qui repudiandae praesentium qui ut quam voluptas nobis ad laborum aut quo qui enim voluptatem enim quae quibusdam vel et facilis voluptatibus ut et omnis aut non recusandae voluptas et distinctio aspernatur quibusdam esse tempore id quia molestiae quia et accusantium fugiat voluptate est sunt veritatis praesentium doloribus ea cumque ratione fugiat voluptatem qui quae esse non perferendis eius maxime atque unde cupiditate praesentium ipsum dolor officiis ut et similique modi mollitia vero labore dignissimos odit non error qui molestiae et dolores alias sequi omnis aut corrupti vel non in porro iure atque rerum et et dolor architecto maxime est quis omnis assumenda magni optio itaque fugiat sed explicabo dicta reprehenderit totam ea rerum sint perspiciatis ex laudantium quidem et rerum illum molestiae rerum sit sunt est distinctio magni at occaecati iusto sed est nam vitae voluptas beatae molestiae cupiditate unde possimus quisquam in aut perferendis deleniti sed sunt ducimus et et itaque sit aliquam neque dolor laborum ipsam blanditiis nulla adipisci vel architecto aperiam rem optio inventore reiciendis consequatur ipsa enim blanditiis reprehenderit nobis magni alias et impedit deserunt perspiciatis amet qui eos autem libero omnis culpa unde dolores aut error eos ut voluptates ut at debitis pariatur provident est sed doloremque voluptatem et repellendus asperiores ut recusandae unde ut quia eligendi autem excepturi corrupti iusto sit ut voluptatibus eum qui repudiandae expedita ut officia tempora et aliquam beatae accusantium qui voluptatibus tempora.', '1', '2017-05-02 22:59:33', '2017-05-02 22:59:33');
INSERT INTO `course_news` VALUES ('827', '7', 'Harum veniam alias a provident itaque eaque.', 'Temporibus incidunt porro unde nesciunt consequatur esse inventore voluptas odio beatae nisi quaerat exercitationem repellat reiciendis quidem culpa laudantium et eos dolor temporibus magnam aut rerum sed debitis id id quis qui numquam quia illo qui cum voluptatem voluptatum qui rerum at sunt dolor distinctio molestiae ea aspernatur repudiandae temporibus odit temporibus earum temporibus sit est incidunt error error repudiandae id aut vero sit quo inventore rerum culpa ratione maiores voluptatem omnis veniam nesciunt sunt quia omnis id sint in omnis qui sit expedita non voluptatem quibusdam qui voluptatum assumenda qui eos qui accusamus velit velit ratione dolorum iure ut delectus est et id et eum ut ipsam nulla recusandae repellendus magni nulla doloribus omnis sit mollitia necessitatibus et accusantium in velit magni tempore omnis enim aliquid rem illum tempora esse molestiae corporis delectus expedita laborum impedit sed cum doloribus necessitatibus illo voluptas aut aut aliquam quia minus dolorem et cum cupiditate fugit ea sint ut nisi impedit quas aut sit eum nobis numquam optio nisi id accusantium quidem omnis corrupti ut eum temporibus ducimus earum qui consequatur dolores voluptatibus architecto vero autem optio unde laborum beatae quo voluptates voluptas fugiat quia ut quas placeat cum aut labore distinctio iusto rem voluptatibus et sint deleniti voluptate dolores nostrum qui in molestiae cumque harum quam aut nostrum vero commodi repellat et qui quas a voluptatem vel repudiandae eaque tempore aut corporis esse repudiandae harum animi sit voluptatibus quas qui mollitia illo sint laboriosam reiciendis ipsam sunt et omnis exercitationem iure autem harum necessitatibus harum consequatur omnis repudiandae quia vitae rerum officia aut qui facilis ut commodi non a voluptate aut alias commodi qui necessitatibus molestiae incidunt sit ab enim accusamus fuga placeat omnis vero magni adipisci iusto sunt dolor eaque doloremque et et qui atque esse odio autem deserunt eos et quia et non veritatis et laudantium occaecati sit tempora dolores in corrupti numquam aperiam commodi dolore est aut non earum autem beatae et enim dolorum quia officia consequuntur alias incidunt qui veniam in rem ea quo autem consectetur maxime et eveniet omnis eos eaque eum ut incidunt dolore minima officiis ut eos sit doloremque sunt facere placeat officiis adipisci tempore corrupti minima magnam enim magnam expedita et aliquam commodi voluptatem omnis molestiae cupiditate quasi ex et eius quia maiores sed est atque ea ut dicta deserunt qui ut.', '0', '2017-05-02 22:59:33', '2017-05-02 22:59:33');
INSERT INTO `course_news` VALUES ('828', '3', 'Qui ducimus laborum voluptas sint.', 'Et harum odio veritatis eveniet corporis numquam qui sed veniam neque et molestiae distinctio sapiente sit magnam tempore voluptatem possimus dicta enim quis dolores temporibus vitae illum fugiat voluptatem dolor ducimus corrupti placeat alias quasi quas occaecati eum aut praesentium esse tempore distinctio voluptatem voluptatibus optio neque aspernatur saepe laboriosam et ea itaque quisquam unde amet voluptas omnis porro iste laudantium voluptatem eos consequatur ipsa voluptatem et occaecati corporis explicabo sint quo illum vitae vel sint asperiores iste odio ipsum est modi cumque qui blanditiis provident est ullam dolore sint id eos magni earum ex consequuntur dolorem illo nesciunt molestiae nihil odio officia itaque neque ea unde consequuntur ut doloribus qui vitae natus suscipit exercitationem excepturi dolores temporibus fugit aperiam sunt dolor ut inventore quia cupiditate neque accusantium optio autem non excepturi est eos illo quo eius et voluptate incidunt sint qui et odio eos omnis quo dolor deleniti dicta facere dolores ut beatae aut velit accusamus vero assumenda animi quod quasi voluptatum perferendis perferendis quia nesciunt earum ut sed suscipit occaecati quo tempora deserunt ut nam aliquid molestias quia mollitia in sed nihil quia doloremque et est voluptate officiis quia ut omnis quia inventore tempore distinctio autem ullam commodi repellendus aut et corrupti adipisci quia doloribus aut magnam ipsam eum officiis iure amet quisquam quo aut sint quas iusto illum fugit totam perferendis maxime quia occaecati dolores et non fugit reiciendis praesentium nobis illum unde consectetur mollitia nulla fugiat voluptas aspernatur illum et amet ipsam quis rerum accusantium et nihil nulla id deserunt optio dignissimos nihil qui necessitatibus hic aut quo harum aliquam quod minima consequuntur ipsam id aliquam aliquid quis numquam aut repellendus eos saepe similique voluptas voluptatem est optio aut ducimus reprehenderit repudiandae molestiae ut distinctio optio id numquam numquam eos quia dignissimos ducimus sint non ab porro quia ea atque dolores excepturi nulla tempora perferendis minima enim similique commodi possimus molestiae quia quis nam inventore consectetur odio sed sed maiores perferendis sit alias omnis autem rerum distinctio voluptatum dolor atque alias itaque omnis voluptas delectus ut quasi at officia laudantium tempora aut ut ut sint quia quis quis eaque soluta sed inventore ipsum enim voluptate vero deserunt sapiente ea explicabo libero aut corporis vel consequatur atque facere necessitatibus cumque voluptatem fugiat et officia deserunt tempora minus qui omnis qui doloremque ipsum tempore accusantium repudiandae.', '0', '2017-05-02 22:59:33', '2017-05-02 22:59:33');
INSERT INTO `course_news` VALUES ('829', '9', 'Esse molestiae nihil et beatae repellat qui enim.', 'Ut delectus provident at qui a iure repellat omnis incidunt perspiciatis ipsa accusamus voluptas quis quaerat voluptas inventore sequi voluptatem qui illum rerum consectetur rerum architecto quo repellendus velit dignissimos et veniam eos aliquam dignissimos cum neque velit optio ducimus dolorem ut dolorem voluptas deserunt sed ut mollitia consequatur cum quasi recusandae qui architecto eius tempora consectetur numquam voluptatum officia architecto sunt inventore quia quasi magni corporis et nulla voluptate labore molestiae qui aut nostrum et tempore omnis harum est totam aut animi et dolor aut dolores sequi sit officia aliquid dolorem praesentium beatae incidunt tempora laudantium doloremque sunt doloremque atque qui facilis rerum asperiores nihil neque aut vero qui ut iusto inventore eaque numquam minima ad dolores minus voluptas vel natus et nobis doloremque nihil ratione quia non aliquid vitae autem sint maxime quae nam qui dolores aut at ut eum aliquam fugit et nulla culpa porro harum ut quo aut corporis quos reprehenderit aliquam cupiditate cum esse quas magnam culpa voluptatibus impedit omnis molestias non et id ad et eos eaque excepturi minima nisi sed voluptatem quaerat ipsa architecto quis iusto officiis dolor alias dolor ut in laborum quia dolorum labore consequatur est et qui non qui ipsa velit dolores quasi cupiditate sequi iusto eos laborum illum et sit voluptatem ab et expedita voluptatibus fuga quibusdam asperiores atque et eos repudiandae amet voluptas sapiente eius provident voluptate nam repudiandae aut dolorem libero dolor perferendis corrupti quo qui consequatur quos soluta sed hic aut perferendis blanditiis vel qui cupiditate eum deserunt excepturi nesciunt consequatur incidunt debitis labore consequatur ad id illo consequuntur sunt ut iure qui voluptas est id provident voluptatem magni iusto molestias doloremque et et sunt vitae perferendis id i