INSERT INTO `course_news` VALUES ('830', '4', 'Ullam id non et minus molestiae ea.', 'Perspiciatis recusandae provident autem voluptatibus ab saepe suscipit praesentium dolorem qui consectetur sed dolore sapiente aperiam maxime illum id sed perspiciatis id quo ex animi ut commodi quisquam optio et aperiam deserunt esse et est esse provident deleniti error voluptatum qui necessitatibus itaque atque doloremque vel explicabo tempora et minus sed occaecati maxime inventore est dolorum necessitatibus voluptatum consequuntur laboriosam porro in exercitationem ducimus quaerat est beatae laudantium sit nisi nihil mollitia excepturi itaque itaque ut vero temporibus dolorem omnis et exercitationem quam autem magni unde quasi laudantium cum nihil enim voluptas impedit placeat debitis laboriosam architecto ut laboriosam quam tempore iusto aut beatae optio id et dolorem culpa dolore at illo voluptates est error quia explicabo est distinctio laudantium enim inventore quis voluptas iusto sint voluptatum excepturi perspiciatis soluta a aut explicabo labore possimus dolorum quo magni saepe repellat dolore amet quisquam accusamus earum amet et itaque et omnis sequi culpa fugiat ut eius et nulla voluptatem cumque velit ut provident unde sapiente accusamus unde omnis voluptatem soluta amet numquam voluptates voluptatem laboriosam sint sequi impedit qui qui vero nobis totam sapiente id labore temporibus sequi natus et pariatur nesciunt quod quia ea aspernatur dolor fugit et maiores eius est laudantium itaque nobis corporis doloremque ut sint ab aut odio aut ullam culpa a voluptas nobis aut delectus et error dolores et et molestiae et et esse eum ipsa rem et rerum dolor possimus doloribus nam reiciendis facilis saepe quis consequatur esse deserunt vitae illum autem consequatur ut reprehenderit ratione aut quidem culpa non enim minus voluptas nihil assumenda placeat voluptatem suscipit quos cumque ducimus deserunt mollitia cupiditate debitis eum aut aut voluptate eveniet et eveniet ex qui