INSERT INTO `course_news` VALUES ('831', '7', 'Non officia quo consequatur omnis quasi.', 'Hic dolorum quas saepe rerum quaerat in necessitatibus atque tempora iusto debitis consequuntur est deserunt animi voluptatem sapiente necessitatibus est autem aspernatur aut accusantium quidem eius sed similique voluptate incidunt dolor eos veniam aut nihil culpa ad sint delectus consectetur et ipsam totam qui unde nisi dolorum nostrum voluptas et dolor quis saepe ducimus quia ut nihil sit autem sed sequi ex qui molestias quia fuga harum possimus odit reiciendis et consequatur voluptatibus eveniet necessitatibus labore amet harum eligendi natus blanditiis et est nobis molestiae illo distinctio amet quis ut et aut et quo qui minus eveniet culpa eos qui repellat at voluptate impedit molestiae et qui ratione non quia saepe aut error blanditiis autem rerum sit temporibus vel praesentium aut laborum voluptatem sequi qui natus ratione doloremque totam praesentium ut voluptatum assumenda optio sapiente recusandae eum debitis repudiandae odio consequatur placeat inventore magni sit quos eligendi aut velit facere quia dolorum sapiente quam temporibus et aperiam temporibus ratione consequatur temporibus officiis nulla omnis ea quos voluptas tenetur placeat amet et veritatis amet aspernatur a et facere officiis et sapiente repellendus quasi illum consequatur cum placeat quibusdam cumque illum asperiores similique corrupti aliquid vel placeat non doloribus aut praesentium velit ut illo ipsum qui soluta corrupti doloremque asperiores quam dolores explicabo et accusantium ducimus dolorem adipisci cupiditate veniam quibusdam aspernatur corrupti maiores vel tenetur placeat vel iusto tempore dolorum aspernatur aperiam ipsa sed laborum impedit excepturi quidem fugit exercitationem in beatae quam quia vel labore deserunt aut dolores ea et qui ex reprehenderit ut blanditiis voluptatem accusantium dolor illum sit ipsam architecto non voluptatem laboriosam est consequatur odit facere sint deserunt