INSERT INTO `course_news` VALUES ('832', '3', 'Minima sint facilis ut non unde.', 'Doloremque similique cupiditate quibusdam est debitis libero quod perferendis in voluptatem ducimus ducimus reiciendis ipsa qui at ut eveniet dolorem eum soluta dolores voluptas sint sapiente dolores sunt in et et quam itaque ipsum dolores beatae doloremque natus et hic voluptatum voluptas voluptatibus omnis voluptatem et velit et eligendi rem voluptatem suscipit tempora iusto quaerat et tempore non eos quod quasi facilis dolores itaque consequatur tempore ea delectus velit numquam veniam atque quidem nobis rerum non voluptas provident quo quod et est iste officia laudantium quod rerum recusandae molestias animi hic suscipit aperiam nam optio et voluptate dolorem nihil blanditiis qui omnis cum ea sint ad dolor ducimus fuga rerum laudantium voluptatibus nisi voluptatibus aut inventore quos eum voluptate quo ut exercitationem maiores qui necessitatibus fuga optio facere non vero quod dolorem mollitia voluptatibus placeat rem asperiores et soluta dolorum odio sed aut et molestias quod molestiae dolores beatae qui fugiat non culpa provident porro nihil cupiditate quod eos doloribus magni sed aliquam minus nesciunt quia non magni distinctio deleniti sint fugiat quibusdam velit officia neque voluptates eum ut blanditiis autem odit distinctio earum qui aut quia aut cupiditate exercitationem eum et quaerat ex magni facere sed possimus autem quas voluptatem tempore recusandae id consequuntur et consequatur tempora itaque odio non facere ullam quod omnis voluptatem voluptatem sed atque excepturi natus optio at id occaecati eos corrupti vel eaque expedita autem sed aut et et accusantium harum error quae odit perferendis voluptates expedita voluptas nihil consequatur natus dolor nesciunt architecto nihil itaque eius explicabo illo sint ut et quo qui sed aspernatur ex reiciendis quis et et illum sed consequatur ad officiis qui officia et expedita quam provident est corporis dicta esse ut ullam qui