INSERT INTO `course_news` VALUES ('833', '4', 'Dolorum qui at veritatis velit qui.', 'Accusamus ut dolorem sint placeat adipisci deleniti dolores et omnis veritatis ipsa occaecati mollitia ipsum rerum consectetur quia nesciunt illo voluptatem autem impedit earum minus quae laborum quae qui alias vel nihil aspernatur saepe delectus distinctio debitis rerum quidem quibusdam excepturi sit aut reprehenderit pariatur nisi consequatur quia provident beatae ut odit consequuntur libero fugiat sequi hic omnis sit sint labore atque id culpa expedita nemo nihil doloremque magni dolorum autem et harum neque autem non eaque ipsa unde commodi culpa quia omnis eveniet dolor modi exercitationem impedit suscipit nisi omnis reiciendis excepturi aut beatae sequi est facilis velit optio maxime harum voluptatibus ipsa voluptas facere saepe exercitationem rerum architecto qui dolorem sunt et quaerat omnis illo sint labore consectetur debitis ab non qui voluptatibus necessitatibus optio omnis unde facere est vero rem temporibus libero iusto quas consequuntur voluptatem est ea consequatur et magnam dolorem illo non provident fugiat ex nisi placeat reiciendis atque quod nobis perferendis itaque odio nesciunt dolores sunt exercitationem ab necessitatibus aliquam ipsam nulla corrupti facere ratione occaecati dolor ut non alias harum aperiam ipsam et fugit illum quia molestias qui dolore sapiente illum quae omnis nobis asperiores culpa omnis laborum quam aut quia aliquid aut cum maxime et et blanditiis sed dolores aut accusamus corrupti laboriosam est facere quia rerum incidunt et quos similique est rerum rem corporis magnam eum nisi facilis maxime qui similique tempora accusamus et consequatur distinctio omnis molestiae ut asperiores qui aperiam odio dicta qui et ut fuga voluptatem possimus molestiae libero consectetur odio modi qui provident voluptatem omnis sit non est vel dolor vitae id aut autem sunt est in autem odit dolorem omnis numquam voluptatem sequi magnam expedita eligendi ut offi