INSERT INTO `course_news` VALUES ('834', '8', 'Sint perspiciatis est cum iure perspiciatis.', 'Similique repellendus eum aut ullam aut inventore similique a quo voluptatem ut excepturi fugit quaerat suscipit aut quaerat maxime officia perferendis deserunt tempore error aperiam ea laboriosam nostrum velit libero error autem omnis qui dignissimos ipsa maiores beatae voluptate quis facilis porro iusto perferendis consectetur quia reprehenderit hic non est vitae quia aperiam laboriosam ut nemo adipisci magni voluptatem magni esse voluptatem sunt natus et odit quibusdam assumenda velit pariatur aperiam ullam enim velit facilis nihil aut aperiam recusandae id commodi a quis perspiciatis qui nihil aut et quis aut voluptatem natus non est similique quo ut voluptate dignissimos deserunt ab non et necessitatibus quae sit et exercitationem et laudantium ipsa placeat id eaque necessitatibus autem ratione ipsam quo minus ut laborum tempora autem quas voluptates non pariatur qui ratione qui omnis porro magnam ut voluptatem nemo officiis voluptas dicta odio totam aut consequatur officiis quo et tenetur amet sunt est et unde pariatur delectus labore incidunt officia molestiae omnis a voluptas velit maiores quia occaecati sit minima quas fuga perferendis soluta omnis sunt excepturi quia inventore voluptatem dolorem quia alias itaque consequatur est magni nesciunt sunt aliquid necessitatibus reiciendis facere sint mollitia cum aliquid exercitationem id dolorum porro nihil quod necessitatibus id velit rerum atque laborum corporis modi adipisci maxime quia voluptates quo eveniet necessitatibus quasi odit quisquam placeat itaque eaque blanditiis praesentium doloribus vel eaque quam ipsa sit quo itaque culpa reprehenderit consequuntur tenetur dolore reiciendis nihil sunt amet doloribus et assumenda perferendis in delectus atque sunt nisi esse expedita quod consectetur dolor omnis placeat et sunt iste eveniet debitis ullam quos mollitia odit et natus omnis fugit officiis tempore illo et d