INSERT INTO `course_news` VALUES ('835', '4', 'Quo ipsa saepe et deserunt.', 'Expedita mollitia dolorem voluptates illo ea tempore ad ut aut voluptates non doloribus non iure velit tempora odio et a neque voluptatum nobis harum dolorem dolores aut et odit voluptas sapiente doloremque recusandae aut adipisci minima quas earum consectetur tenetur quia quia odit quo est officia maxime esse laudantium modi quia eos excepturi tenetur atque soluta ut vitae ex rerum dolorum quas pariatur est ea aperiam mollitia optio voluptatem sint ut aut voluptatibus dolorum voluptas tempore praesentium ut laborum at maxime quia dolore laboriosam necessitatibus reprehenderit asperiores rerum sed aliquid laborum sunt mollitia quia laborum minima amet culpa reprehenderit quis quis inventore sit ut dignissimos tempore iusto eligendi quae id debitis non dolores tempore quas dignissimos at et expedita maiores ex mollitia nisi nihil quam iure fugit molestias nihil reprehenderit ad perspiciatis recusandae quis quia eaque iure quaerat voluptatem quos quae delectus aspernatur et sunt reiciendis tenetur iste et ut molestiae beatae inventore necessitatibus perferendis perspiciatis aut quos fugiat dolores minima sit consequatur dolores sapiente ea qui ea in odit omnis aliquid aut vel ut a non voluptas quos ea enim error aliquid non aspernatur aut ut at aut earum aspernatur consequatur atque nobis sit veritatis minus sed dolorem quos velit nam mollitia accusamus laboriosam quidem eos et recusandae tempora in ut itaque ut sed voluptatem aspernatur sit omnis saepe.', '1', '2017-05-02 22:59:34', '2017-05-02 22:59:34');
INSERT INTO `course_news` VALUES ('836', '7', 'Eaque blanditiis dolorem eligendi voluptas dolorem ipsa voluptatem.', 'Natus ex facilis quis ea quia quaerat reiciendis dolores ratione iure qui tempora quo repudiandae ut fuga facere possimus et nostrum voluptas id modi soluta aut quibusdam omnis sunt harum harum provident ut quia nemo qui numquam commodi et quis repellendus rerum rerum omnis eius modi inventore quis error ipsum iure harum iure vel voluptas soluta omnis earum voluptate quas qui dolor perferendis omnis quis maxime qui temporibus saepe sapiente ut necessitatibus qui et reiciendis error in officiis dolores optio amet alias reiciendis quam quo qui est sunt officiis sit laudantium asperiores laborum unde aperiam ducimus maiores commodi qui aliquid voluptates soluta voluptatibus natus aut ex placeat modi sit qui in maiores hic qui quaerat error debitis sequi et repudiandae natus facere consequatur ducimus eos animi inventore id recusandae iure voluptate quos omnis esse quod sit quas voluptatibus odio ut reprehenderit facilis tempore quo magnam velit nesciunt totam minus accusamus voluptate sapiente commodi ut dolorum dolor rerum aut maiores fugit aut tempora tenetur quis eum enim eos accusantium corporis doloribus eos qui laboriosam distinctio est repellendus sed enim beatae ea dolor qui quia officiis officiis non voluptas eius et id iusto placeat voluptatem sint nihil fugiat totam sed et repellat officia animi animi velit excepturi ex qui aperiam provident et deserunt quia in voluptatem pariatur placeat nam perferendis dolorum unde unde vel quis omnis eius asperiores libero at illo saepe culpa veritatis iusto ab quasi sint et aut sint ut sapiente modi quia unde et laudantium pariatur quia vitae pariatur adipisci perferendis omnis quod voluptatem aliquid incidunt et quia cumque non et.', '1', '2017-05-02 22:59:34', '2017-05-02 22:59:34');
INSERT INTO `course_news` VALUES ('837', '10', 'Corporis accusantium facilis est explicabo nostrum est.', 'Explicabo cumque quod est magnam mollitia ipsa ipsum ad commodi ducimus ullam similique et consequatur ipsum qui at quae placeat officia quod accusamus et id animi voluptas repellat totam laudantium voluptatem quas velit explicabo voluptas animi non nobis sit error sint quasi sint sunt magnam harum dolor assumenda in quaerat rerum sint ut excepturi libero sequi possimus ut consequuntur laboriosam velit velit ipsum ut aut id consequatur atque et dolorem officiis alias aut voluptates ab architecto in sapiente harum consequuntur officia nemo quo qui voluptatibus quidem iste natus omnis hic quam ipsum possimus itaque qui ad impedit ut consequuntur voluptatibus laudantium in totam et voluptas itaque sapiente illo quae maxime assumenda eos aut illo voluptates commodi facilis ut nostrum similique eos quos atque nisi consequatur occaecati qui magnam illo aut facilis doloribus ipsam omnis in omnis tenetur non consectetur eligendi est perferendis fuga nobis corrupti sunt ea ea quia nobis fugiat id beatae sed nobis laudantium id eos sit fugiat explicabo accusamus doloribus perferendis repellat dolor distinctio sunt amet quia est itaque placeat placeat laborum alias nihil veritatis animi omnis est facilis eum unde iste non qui ducimus ut totam aut ipsa autem qui ut aliquid ut qui maiores officiis aspernatur et et modi magnam alias vero perferendis similique asperiores dolores iure facere labore a dolores voluptas reiciendis et fugiat optio minima illum itaque nisi sit rerum aut voluptatem ut laboriosam aspernatur maxime ut totam quas odio voluptatem ut earum in voluptatum aspernatur aut cumque dolorum aperiam magnam iste similique porro molestiae voluptatem facere suscipit et explicabo mollitia magni rerum et sed tenetur voluptatem laborum voluptatem enim quibusdam impedit molestias est est quod voluptas tempora ab quae consequatur asperiores fuga vel consequatur voluptate