INSERT INTO `course_news` VALUES ('838', '7', 'Alias recusandae sed dolorem quibusdam id ad magni.', 'Atque aut modi odio velit quibusdam illum vero impedit dolore tempora rem possimus ea est tempora dolores suscipit odio aliquam vel excepturi laborum enim veniam voluptates sit quia cum vel quod distinctio cumque est minima est et provident aliquid nobis occaecati est eveniet et vel et culpa necessitatibus non quia enim doloremque qui quae quod ut qui qui non unde in rem omnis quasi quia molestiae ipsum commodi omnis aperiam dolore suscipit esse dignissimos nostrum praesentium ut aut velit id quisquam accusamus veniam porro et minima error consequatur fuga dolor nobis maxime iste vero in temporibus qui dignissimos nam consequatur quis quam laudantium rerum mollitia quam autem quibusdam eaque non enim eum omnis vero dolore quia doloribus quam incidunt eligendi sint omnis laudantium error laboriosam molestias incidunt eos optio aut sit distinctio aliquam ea ut delectus quaerat dicta qui voluptatibus et fugit natus assumenda ut dolor placeat itaque sed doloribus officiis vel nihil sunt sint voluptatem ut praesentium qui non dolor corrupti quisquam voluptatibus fugiat ad sit ea cumque nihil quibusdam fugit repellendus ex ea officiis est sed perspiciatis sequi consequatur odio corporis odit sed iure dolores delectus non quo molestiae quasi perspiciatis quia quis sint ut delectus harum aliquid possimus cupiditate ut quia et culpa nemo quia qui autem dolor reiciendis debitis nam accusantium quasi quasi dolor qui provident dolor ea vel et quo alias velit ut quia eum aut aut est sint ea cum occaecati eius aut est error veritatis voluptatum soluta in autem tempora temporibus totam fugit est debitis odit nulla praesentium et sit consequuntur dolor voluptas adipisci nobis consequatur vero animi pariatur voluptatem aliquam cumque natus omnis aspernatur quaerat omnis nesciunt praesentium quibusdam aut reiciendis consectetur ex et illo cumque officia nobis animi voluptatem reprehe