INSERT INTO `course_news` VALUES ('839', '10', 'Consequatur asperiores ut et magni.', 'Tenetur et culpa cum maxime voluptatem rerum et ut est ut sint quo rem ea praesentium aut iure eos modi quam ducimus earum voluptatem eius asperiores dignissimos officia quis ipsa consequatur ratione assumenda corrupti dolores atque perferendis et itaque consequatur rerum tempore non voluptatum inventore magnam facilis alias dolores et iusto repudiandae dolorem vel animi fugit eum error debitis et facere neque aliquid nihil consequatur optio illum sed quidem quis perspiciatis veniam quod quos exercitationem in ut hic magnam tenetur quae culpa necessitatibus delectus eos saepe vel et quidem eveniet et molestiae error provident iste doloremque et culpa aut quia possimus aut odio rem sed sed quia tenetur nesciunt quasi molestiae cupiditate alias magni rerum dolorem hic natus odio placeat asperiores nesciunt ducimus dolores architecto non rerum impedit eius quia tempore nam et maxime similique consequuntur voluptatibus mollitia reprehenderit maxime est est consequatur ut modi est sapiente laboriosam voluptatum repellat dolorem sint occaecati corporis deserunt cupiditate non nisi vel et maxime impedit nisi eos sit suscipit qui recusandae dolorum ullam inventore odit adipisci adipisci nisi aperiam pariatur quis id ut qui ex soluta ipsam cum eveniet suscipit et adipisci sit non quasi aspernatur quibusdam veniam nisi magni corporis non qui est sequi sit nihil nam vitae dolore et.', '1', '2017-05-02 22:59:34', '2017-05-02 22:59:34');
