INSERT INTO `course_news` VALUES ('842', '5', 'Cum qui deserunt repudiandae illum facere recusandae saepe.', 'Et ea tempora facere porro facere blanditiis ducimus perspiciatis nobis quo quis et itaque odio molestiae doloremque quia hic tenetur explicabo quis consectetur nam quaerat deserunt beatae qui atque ut et nemo adipisci odio iste voluptas quos cum et iusto laborum excepturi et esse recusandae eum quasi vero voluptatem molestiae cumque voluptate vel in id facere quidem quia omnis ut tenetur non tenetur eveniet aut quis quo ut incidunt qui veniam dicta beatae est corporis expedita blanditiis voluptatem est dolor expedita beatae adipisci dolorem et numquam perspiciatis consequatur quo facere debitis et ut quos est quo voluptatem quisquam numquam totam et cum itaque ad iste libero odit nostrum ab ducimus et autem non et adipisci repellat vel inventore voluptatem aut veritatis sit aut molestiae atque maiores quia tenetur velit quae soluta dicta nulla voluptatum dicta molestiae omnis voluptate dolor eius dolorum id rerum sequi alias dolores earum qui quasi inventore quia animi veritatis explicabo qui et ab nihil commodi qui minima tempore voluptatum est nisi iste et minus dolorem vel earum corporis minima aut ea aut eveniet sed voluptatem aut odio modi quis facilis nesciunt et et sed voluptas modi iste et et.', '0', '2017-05-02 22:59:34', '2017-05-02 22:59:34');
