INSERT INTO `course_news` VALUES ('845', '10', 'Quasi quo accusamus enim ex.', 'Qui quod voluptatibus cum perspiciatis quis placeat et sapiente quia id autem nesciunt quia officia omnis voluptatem sit omnis sequi sit dolor voluptatem porro perspiciatis voluptatem animi magni sed qui et quisquam dolorem est amet aut saepe ullam qui mollitia et veritatis voluptas temporibus occaecati autem est tenetur quod ut neque eum alias sed est sunt sed quia reiciendis iste nihil in perferendis asperiores rerum enim maiores ut corporis sint qui veritatis qui voluptatem est ipsum explicabo optio voluptatem modi qui eos deleniti cupiditate officiis nihil autem consequuntur aut et et esse qui sunt ea quibusdam earum ab corrupti voluptates fuga nostrum quod esse nemo autem tenetur quia debitis consequatur magnam corrupti et omnis non ducimus amet commodi aut saepe similique tenetur et fugit sapiente unde itaque eius nihil et cumque officiis distinctio voluptas culpa consequatur amet amet excepturi eligendi quam vitae est velit nemo ut ipsa esse nisi neque dolorum voluptates quis maiores doloremque aut alias perferendis dolorem quos optio pariatur sit qui ex sit necessitatibus saepe ratione quo molestias assumenda totam earum accusantium velit tenetur magni nisi sed quasi doloribus culpa est blanditiis aspernatur rerum numquam voluptas temporibus modi animi ut possimus incidunt culpa et eos ut dolorem necessitatibus hic corrupti illo sit adipisci totam aperiam natus aut fuga in in quo incidunt deserunt blanditiis et vero sint non temporibus explicabo sapiente natus tempore tempora sed cum eius saepe corrupti dolorum placeat voluptas iste similique veritatis pariatur voluptate beatae deserunt nobis similique autem autem explicabo dolorum et velit velit optio et sed voluptatem perspiciatis voluptas sed ea unde recusandae aut sunt in exercitationem ipsa dolor ipsam ab tenetur et assumenda dolores blanditiis saepe pariatur dolores aperiam aut ipsum omnis numquam iusto illum itaque consequ