INSERT INTO `course_news` VALUES ('849', '7', 'Delectus et aut minus exercitationem.', 'Ut quas magnam enim aut amet sit facilis dolores est eum architecto sit possimus quia rerum commodi eius ratione distinctio ipsa quis quibusdam quos ab odit est nostrum odit saepe facilis magnam aliquam nobis provident incidunt maiores natus ipsum dolor maiores architecto et doloribus quam nesciunt aut commodi id nostrum molestias eum voluptate maiores quam quas est quas sed consequuntur eaque rerum omnis incidunt qui nobis aut et veniam est et qui a quis voluptate voluptatem est voluptas dolor quo voluptates tenetur rem qui deleniti magni repellat nostrum illum eius ut a expedita est inventore et tempora dicta consectetur asperiores nostrum in occaecati delectus molestiae eveniet voluptatum occaecati minus ut eos qui quas sunt eos necessitatibus quisquam vel dolor assumenda sed doloremque et inventore occaecati voluptatem doloribus aut itaque minima itaque rerum eos qui ducimus amet inventore rem suscipit inventore esse aspernatur facilis impedit rerum autem officia quos voluptas in quaerat beatae tenetur tempora officiis eos aperiam iste illum recusandae quisquam praesentium perspiciatis ab et eum et et et deleniti facilis quo et inventore voluptas commodi alias ipsa ipsum minus natus beatae consequatur est illo labore aliquid quis sint optio qui sapiente voluptas dolor dicta impedit earum aut tempora autem unde sequi ut cupiditate rerum dolor sint quia voluptatem reprehenderit magnam nulla maiores qui optio saepe et corporis iste deserunt est sint ea at laboriosam cupiditate consectetur dolorum nulla accusantium saepe minus saepe incidunt labore ipsum molestias ratione quos voluptatem animi qui itaque odio in ut consequuntur dolores voluptatem laudantium fugiat debitis qui recusandae ut pariatur qui ea sed.', '0', '2017-05-02 22:59:35', '2017-05-02 22:59:35');
