INSERT INTO `course_news` VALUES ('852', '2', 'Tenetur quo assumenda qui eaque error optio.', 'A pariatur magnam qui quae officia totam quis quo odit quos magnam repudiandae dolorem expedita sed aut sit possimus facere reprehenderit commodi eligendi adipisci quidem possimus sed qui rerum atque eos iusto quia cum culpa esse officiis perspiciatis et sed vitae placeat eos et debitis repellat autem necessitatibus vero assumenda laudantium et praesentium quam molestias vero vero facere unde et consectetur qui alias quae voluptatum nobis ea molestias distinctio tempora ad incidunt aut odio nulla ratione nihil cumque dolores et ut omnis voluptatem possimus et est assumenda officiis consequatur iste quo exercitationem aut velit inventore pariatur aliquid voluptatem id est est aut consequatur aut quas quia voluptas accusantium est neque voluptas quam saepe hic labore perspiciatis laudantium blanditiis eos ducimus omnis autem saepe repudiandae ab temporibus autem sunt nesciunt recusandae numquam eum ex quasi ut possimus eum beatae adipisci tenetur dolorem est ea voluptatum in quia maxime velit id molestias nam impedit repellat in nisi qui atque est natus esse ut pariatur molestiae velit et magni expedita blanditiis quos sapiente quas omnis dicta minus in tempora voluptas et commodi distinctio magnam nulla iure omnis quae quasi et et est id quis porro sed omnis minima repellendus aliquid labore et animi modi est tempora est tempora odit at ea corporis quia deserunt nisi et nam nam eius dolorem cumque qui voluptatum veritatis perspiciatis ex ut sunt voluptatem deserunt nam et deleniti fugit aperiam iste est architecto neque vero repellat doloribus magnam et doloremque nesciunt exercitationem aut dolores iusto delectus voluptatem unde veritatis quibusdam voluptatibus impedit fugit excepturi laudantium velit magnam eos accusantium in quas laudantium illo eos minus consequatur laborum nihil nemo harum harum accusamus corrupti vero maiores qui labore est voluptatibus vitae qui temp