INSERT INTO `course_news` VALUES ('853', '9', 'Fugiat velit aut explicabo.', 'Quisquam qui et sint omnis pariatur accusantium dolorem facilis aliquam officiis adipisci nihil explicabo sed quas explicabo voluptas quo ipsam quia fugit iusto unde ex amet nihil enim dolores recusandae quis labore distinctio at vitae quia ea reprehenderit adipisci deleniti sed fuga voluptas voluptatem debitis in sunt sed dolore quo dolores et autem accusamus omnis at praesentium quae possimus id perspiciatis sit quod aliquam quaerat qui et quo eligendi deleniti et enim et et quia dolores est est quia et quidem neque dignissimos aliquid et reprehenderit sint rerum et qui eaque asperiores ut cum iure perspiciatis sunt id modi inventore perferendis esse ex dolores est unde porro voluptatibus debitis aut quo qui delectus iusto omnis et aliquid sit et debitis et aut quis optio odit dolores adipisci ea ea aut facere illo porro unde eaque molestias alias consectetur nemo itaque incidunt ut deleniti tempora vero numquam voluptate in quibusdam animi porro eveniet at inventore ducimus voluptatibus qui aut expedita mollitia magni voluptas similique dolore est fuga assumenda aut repudiandae labore aut impedit ea repellat occaecati voluptas ut facere et aperiam animi eligendi qui asperiores autem autem hic porro impedit exercitationem praesentium eligendi voluptatum est voluptate deserunt in harum quisquam vel qui quas similique nesciunt non sint qui quia est sit exercitationem labore veniam et rerum sit minima quo enim ullam id unde et qui eum quo quasi ut corrupti illum et qui consequatur a et voluptas totam iusto commodi doloribus iure architecto quam voluptatem dolorem id possimus est repudiandae necessitatibus laborum dolore consequuntur omnis nisi quam pariatur quis nobis reprehenderit voluptatibus fugiat et minus tenetur qui eum veniam velit consequatur ut possimus mollitia dolore.', '0', '2017-05-02 22:59:35', '2017-05-02 22:59:35');
INSERT INTO `course_news` VALUES ('854', '6', 'Quo nihil mollitia accusantium qui assumenda ea.', 'Esse voluptatem sint architecto totam delectus aperiam natus quo quis quod nemo aliquam facere perferendis quos commodi enim ea est totam nam adipisci veniam voluptatum aut cupiditate repudiandae voluptatem dolorem aliquam nostrum expedita unde non minima officiis facere perferendis molestiae aut neque magni vero qui omnis molestiae eum et occaecati quidem voluptate sint atque vitae vero harum dolore et enim unde sed officia eveniet dignissimos consectetur praesentium doloribus alias aperiam earum laborum omnis dolorum facere dolor architecto aut ut nobis officia perferendis rem cumque numquam sapiente vel commodi dolores et qui ut corporis minus voluptatem saepe voluptatem molestiae et eos vero et nam suscipit officiis rerum esse et consectetur minima officiis ea nihil tempora consectetur accusantium vel deserunt omnis placeat aspernatur possimus accusantium dolor quia officia est et dolores animi nemo doloremque deleniti animi quae id impedit et et autem quia accusantium officia veritatis est necessitatibus quisquam quos velit est illo exercitationem incidunt asperiores nihil ut quae reiciendis vel sit iusto culpa labore est officiis quo sunt nisi architecto quos cum et enim et ab numquam non cupiditate repudiandae nostrum voluptatem a vel excepturi eos sint fuga et quod quibusdam voluptates ut eligendi assumenda itaque eum fugit explicabo excepturi dolorum aut atque ratione dolorem quasi aut ut voluptatem blanditiis consequatur voluptas saepe suscipit dicta ad nam laboriosam aut magni omnis vel qui soluta non voluptatem sit voluptate possimus et rem vel sed minima ipsum atque officiis et facilis tempora doloremque dolore ad qui quam fugit sequi a illum accusamus magnam magnam quae in dolor est commodi ea dolore omnis sunt ipsam sit eaque placeat vero dolor occaecati at quod quia perspiciatis deleniti beatae porro voluptatum et sequi.', '1', '2017-05-02 22:59:35', '2