INSERT INTO `course_news` VALUES ('855', '5', 'Debitis est accusantium praesentium commodi.', 'Accusantium numquam qui eaque aspernatur libero rerum dolores quae autem nihil voluptate eum aperiam ex consequuntur similique voluptatum ipsam modi velit qui consequuntur neque eum aut ut aliquam ut esse a quasi labore placeat ea magni vel quia eius unde voluptatem enim ratione doloribus voluptatem ducimus molestiae quas architecto perferendis officia veritatis sed in mollitia amet quo quaerat et molestiae voluptas sed ratione beatae consequatur voluptas corporis eaque aperiam veniam voluptatibus cumque sed ut magnam suscipit incidunt recusandae alias quae ullam sit tempore cumque vel tenetur dolor aut vero eius consequatur enim eligendi et qui quasi aut voluptas nobis quia aut impedit aliquid qui in doloremque rem totam cumque rem itaque debitis et asperiores expedita asperiores voluptatem omnis id aut voluptatum perferendis eveniet rerum maxime velit aperiam nam non tenetur omnis incidunt et sunt ipsam natus corporis qui vel fuga ex ducimus est enim sed exercitationem minima et delectus delectus ut similique dolorem ea laboriosam vel vel neque accusantium voluptate est ut omnis et sunt et distinctio incidunt molestiae sint eveniet aut perspiciatis nemo fugit iure autem sed dignissimos voluptatum est qui velit dolorum est qui rem voluptas quaerat ut quia illum non consequatur illo quos sint ea autem eos voluptas dolor commodi ab aut neque et alias nihil voluptatem non voluptas qui rerum explicabo reiciendis illum nesciunt iure dolorem et consequatur quos reprehenderit aspernatur aut quam sequi laboriosam quaerat sed alias tempore hic consectetur cumque consequatur minus animi nostrum dolor soluta temporibus quia eveniet unde dignissimos libero eaque quo porro nisi dolorem sequi hic minima inventore voluptatum voluptatibus est voluptatibus est reprehenderit sint dolore voluptatibus debitis saepe non voluptas quia officiis minima ullam placeat labore atque qui nihil et fug