INSERT INTO `course_news` VALUES ('856', '7', 'Et aut dicta eligendi.', 'Ut aut quibusdam illum accusamus dolorem in accusamus illo dolor sunt autem quia omnis architecto est aliquid veniam molestiae officiis consequatur velit sint quo ad soluta maxime tempora velit provident dolorem ea nam ea quae ipsa dolorem asperiores officia at accusamus odio corrupti corporis dolor quae dolorum voluptate ut ullam est distinctio mollitia incidunt eum odio repudiandae fugiat culpa ea quaerat exercitationem autem nesciunt sunt consequatur quo officia aut laborum voluptatem sit rerum earum voluptatem quaerat magnam velit perferendis similique occaecati velit sequi deleniti minus ratione quis sed perspiciatis tempora quod voluptatem atque animi in repudiandae quia et debitis expedita rerum aut sequi eum doloribus neque odit eum exercitationem et possimus eum magnam sed qui sequi voluptatum ex eaque minima eos dolorum aperiam asperiores voluptas autem dolorem aliquam sequi maxime et accusamus harum atque rerum sit quas quis rerum asperiores ratione veniam provident dignissimos minus eum delectus sint sed aut quo aut modi esse voluptas rerum rem consequatur fuga cumque voluptas velit aut nihil rerum porro et et est dolorem et maxime possimus ea quasi necessitatibus aut et eveniet temporibus aut explicabo consequatur delectus eveniet mollitia cupiditate aspernatur doloremque totam error dolorem sed harum adipisci libero omnis voluptas aspernatur laboriosam eius eos et at itaque quisquam et ut.', '0', '2017-05-02 22:59:35', '2017-05-02 22:59:35');
INSERT INTO `course_news` VALUES ('857', '5', 'Commodi quis nam est laborum sint laborum.', 'Est qui vel neque sapiente qui qui ea ducimus accusantium dolor accusamus non iusto impedit placeat est unde molestiae distinctio cum debitis quas qui officiis corporis quis cumque dolor ipsa et consequuntur possimus veniam delectus nostrum non cupiditate et deserunt consequuntur praesentium nihil consequatur quisquam perspiciatis facere ut quisquam et molestiae et quidem voluptatem libero quidem esse ipsa et quia ad et atque aut suscipit omnis recusandae ducimus totam voluptas ipsa doloremque beatae expedita sint molestias quis totam optio natus et beatae qui doloribus in ratione distinctio et nobis eum sit dolores omnis sunt unde illo iste quia similique ratione quia saepe placeat voluptatem labore impedit fuga ut et id totam ut animi corporis harum fugit tenetur qui rerum nihil numquam est est at neque ducimus quis nesciunt dicta mollitia deleniti laborum vel quia et vel sit enim est fuga beatae quidem eveniet esse soluta corporis in ex recusandae iure fugit temporibus vel quia neque sapiente ipsa hic suscipit architecto eaque quam molestiae suscipit expedita voluptatem sit ut assumenda vel praesentium aperiam et voluptatibus deserunt odit animi eaque sit sint omnis ex deserunt pariatur ea ut est excepturi ab quia dignissimos tempore sed eum cupiditate sit similique non commodi adipisci tempora animi laudantium et fugiat ratione ad ullam voluptatem asperiores corporis eligendi aperiam consequatur nulla reiciendis animi odio ut unde quas quaerat cum odio temporibus magnam sint quidem inventore ullam est enim ab ipsum quia autem dolorum omnis explicabo asperiores ut ut dolor corporis aut minima et rerum voluptatem ea voluptatum a iure ipsum non quasi est est similique ut dicta non suscipit nulla delectus delectus dicta neque.', '1', '2017-05-02 22:59:35', '2017-05-02 22:59:35');
INSERT INTO `course_news` VALUES ('858', '2', 'Quo sed est est nemo.', 'Aperiam eum voluptatem deleniti explicabo et voluptas ipsa eos deleniti consectetur qui sunt accusamus magni pariatur velit dolore quos doloribus iure quis et enim modi aliquid ipsa animi soluta quam porro vitae consequuntur dolorem illo molestiae officia sequi rerum voluptatem cupiditate nesciunt iure totam tempora vitae saepe dolores voluptatibus iure qui suscipit omnis et nihil consequuntur qui soluta quia consequatur ullam et eos aut odio temporibus sit omnis qui omnis quia nulla distinctio libero nesciunt dolorem nihil velit exercitationem ad officia rerum laboriosam impedit ea dolores quos pariatur quae nesciunt saepe sint doloremque eius consectetur ab natus nulla nihil ad dignissimos reprehenderit adipisci ad ut officiis repellat quasi explicabo quia non possimus consequatur sit et rerum necessitatibus fugiat voluptas et debitis sed ut praesentium eveniet nihil occaecati aut dicta nemo aspernatur ipsum qui ab excepturi blanditiis deleniti repudiandae voluptatem non voluptatem odio hic voluptatum id enim tenetur sunt quibusdam ipsam et ratione blanditiis praesentium aliquam harum omnis est cumque laboriosam illo perspiciatis laborum ut nesciunt esse consectetur doloremque nihil eos nihil ut odit inventore sit optio sint nisi ex est repellendus magni quidem vel vel sed impedit consequatur aut cumque molestiae est iste omnis odit vero cum error explicabo voluptatibus quidem et exercitationem veniam dolores saepe officia impedit repudiandae veritatis quo maxime quia ducimus vel praesentium non dolorem ea hic sed aliquid iusto unde aut sit eum et impedit numquam est non.', '0', '2017-05-02 22:59:35', '2017-05-02 22:59:35');
