INSERT INTO `course_news` VALUES ('862', '5', 'Repellat harum quisquam excepturi esse et laboriosam.', 'Ratione odio fugit quia quidem voluptatem magnam sed nemo alias aut quasi qui possimus voluptas consectetur id nesciunt incidunt est aliquid occaecati dolores necessitatibus voluptatem porro soluta eos voluptatum et ducimus recusandae expedita atque veritatis sed eveniet maiores magni est illo id quisquam qui non accusamus cumque ut amet quam rerum quas saepe ut fugit et quis omnis omnis vero harum eum velit et dolore corporis molestias error animi placeat aut natus odit porro sint ut molestias veritatis laborum non explicabo illo consequatur sequi omnis a laborum repellendus commodi consequatur ab voluptate fugiat dolores ab est necessitatibus amet delectus minus a cum est consectetur quo consequatur aliquam occaecati qui excepturi facere facilis quia nesciunt eum deleniti occaecati necessitatibus quaerat libero quis aut quo assumenda voluptatem explicabo qui magni ad non ea laboriosam praesentium aut reprehenderit maxime est dolore neque similique veritatis modi placeat ut est possimus facilis illum quia vel sit ipsum debitis eos laborum aut distinctio dolorum illo sed omnis adipisci perspiciatis dignissimos est et ut suscipit quae fugit magnam earum maxime dolor omnis ut non hic velit quisquam libero iusto et numquam laudantium explicabo debitis repellendus dolor ut commodi tempora omnis pariatur quasi quia est minus maiores perferendis laboriosam natus quo non placeat ab animi fugiat unde velit expedita quis ex earum incidunt officia iusto dolores sit nisi et omnis eos minima qui sapiente maxime eaque placeat et aut veritatis voluptatem eligendi excepturi voluptatem incidunt minima ab molestiae hic et nam consectetur doloribus repellat earum non porro perspiciatis laborum consequatur impedit dolor aut et facere assumenda illo et nam qui quisquam maiores cupiditate voluptas cum sed quas dolor commodi autem maiores incidunt necessitatibus minima modi aperiam est