INSERT INTO `course_news` VALUES ('863', '3', 'Reiciendis qui atque et sint quis quibusdam.', 'Eum id suscipit veritatis dolor in quaerat esse est ab consequatur et veritatis nam incidunt ut reiciendis harum laudantium fugiat molestiae assumenda vel eos et reprehenderit id reprehenderit sit aut dolorem perferendis fuga dolores atque magni nemo ut sequi consequatur et est incidunt sapiente a qui exercitationem molestiae nostrum magnam nesciunt expedita ex porro quae quia vel veniam et nobis illo ut rerum soluta tempore deserunt voluptas tempora eveniet voluptate expedita consectetur ipsa est qui voluptatem nemo pariatur occaecati nobis dolorum in voluptatibus aliquid repellat totam provident et itaque necessitatibus officiis at ut totam iste omnis eius corrupti velit debitis nulla harum aut sint in asperiores qui sunt voluptas debitis nisi iusto quas voluptas et quaerat praesentium facere aspernatur minus nostrum quia vel dolores commodi possimus in dolorum eaque aperiam et officia laboriosam qui quia repellendus nihil beatae omnis rerum quis veniam facilis et iste consectetur dicta velit atque expedita quam expedita itaque optio illum et est occaecati repellendus consectetur iste voluptatem nemo quas sit molestiae eos et labore quia odit assumenda dignissimos iure maxime dicta nihil vel ducimus reprehenderit necessitatibus aperiam illo optio impedit assumenda quas placeat laudantium dicta ea blanditiis enim in excepturi deserunt modi culpa mollitia autem est et nostrum ratione molestiae minima dolorem id autem veniam quo non eos nobis in animi ut earum eveniet consequuntur.', '1', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
INSERT INTO `course_news` VALUES ('864', '5', 'Ut porro fugit veniam quo iste harum.', 'Et aut ut porro aperiam cumque consequatur non officiis expedita id dolor consequatur iste excepturi minima impedit ut asperiores repellat eos reprehenderit a atque expedita sunt dolorem voluptatem delectus aliquid aliquid quam quibusdam laudantium soluta quasi non occaecati laboriosam dolore ut velit cupiditate corporis ea autem sit et id hic officia optio ut nobis qui sunt eius aut magni nihil rerum eaque enim quod quia aspernatur eligendi saepe quibusdam ea saepe architecto eveniet delectus ut expedita repudiandae molestias voluptatibus vel quia eos at voluptatem quia officia dolorum distinctio atque quibusdam corrupti ut in est et officiis voluptas debitis et nulla quaerat sint enim maxime reiciendis qui earum non eos nesciunt enim non similique sit qui ea quas autem et est dolores sit sit et est fugiat sunt id ratione dignissimos voluptatum autem culpa sed qui architecto iste hic delectus rerum eos voluptas adipisci laborum enim doloribus ut quia voluptatum praesentium quasi omnis est dolores nostrum labore maxime nihil id veniam ex sed optio a beatae quos non omnis vel tempore error molestiae consequatur doloremque voluptatem impedit sit rerum quia accusamus quaerat nemo temporibus suscipit aut quidem voluptate laudantium dignissimos occaecati incidunt facere qui vero ea id ex doloribus est debitis sequi et repudiandae sunt nisi soluta cumque accusamus qui nemo ut odit est officiis dolor aperiam officia quia quia dolor fugit reprehenderit nam nisi nemo adipisci praesentium nihil vero possimus molestias nam nihil ipsum omnis consequatur fugit excepturi qui omnis officiis itaque eum quia expedita perspiciatis porro sint iusto earum sed ratione dicta vero dolorem quia optio officiis vel omnis magnam sed omnis cum ut consequatur fugit nobis laboriosam omnis quia non aut alias beatae alias explicabo aut sapiente illo vel consequuntur earum quibusdam illum vero dolores beatae vol