INSERT INTO `course_news` VALUES ('865', '5', 'Quia enim doloribus quod quo corrupti.', 'Qui ut minus quidem dolorem deleniti neque deleniti voluptas ut odit nostrum ut placeat qui consectetur expedita ut sunt repudiandae qui incidunt molestias ut aliquam et et libero harum quam magni minus explicabo eaque amet dolor consectetur eos quasi aut dolorem sed sit quam quia facere sed nesciunt voluptatum impedit saepe non sequi dolor et voluptates voluptas fugit dignissimos qui quasi delectus aspernatur aperiam non architecto fuga harum eum ab rem accusamus molestiae aliquid qui explicabo sit ullam laborum voluptatibus ipsum architecto ut non eius modi blanditiis sequi debitis magnam velit qui iste natus occaecati corrupti est doloremque debitis explicabo ab quia omnis asperiores voluptas ipsa illum ad possimus et repellendus enim perferendis nemo commodi mollitia nesciunt atque quis omnis rerum repellat molestiae sint rerum aut est quibusdam aspernatur quo nihil et qui excepturi facilis illum labore nesciunt quia assumenda fuga doloremque reiciendis temporibus sunt consequatur reiciendis rerum quod excepturi voluptatem iusto earum doloribus sint minima a repudiandae minus laudantium maxime quae at rerum veniam tempore recusandae minima facilis nihil veritatis tenetur rem dolore eos non sed impedit cupiditate doloremque id accusantium soluta quod nemo et similique ex sunt tempora amet ut adipisci rerum impedit consectetur.', '1', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
