INSERT INTO `course_news` VALUES ('867', '3', 'Vero et et sint libero porro veniam repellendus.', 'Est et consequatur at quae in et unde possimus odio vitae et exercitationem quod consequatur odit ea officia molestias voluptatem nesciunt minus temporibus ut ut molestiae rerum blanditiis magnam amet in aut quasi unde est in voluptas velit atque aspernatur perspiciatis velit odit quod perspiciatis odio aut et vitae sit accusantium et rem hic sed debitis velit corporis optio qui incidunt maxime enim at corrupti rerum amet ut dolorum quas debitis inventore at est dolore omnis enim iusto nihil unde nemo qui odit ratione accusamus amet fugiat qui qui inventore minima et delectus impedit sit aut porro at quam qui enim est natus nesciunt voluptas nulla ut nulla molestiae cupiditate dolores facilis non dolores cupiditate mollitia id ipsum magni excepturi enim beatae sed nemo maiores est nulla ut sunt adipisci maiores aliquam et eos eligendi debitis id earum praesentium rerum qui ut dolores sed rerum nihil aliquid dolores et et expedita natus qui fugiat pariatur aut vel incidunt beatae sint quas rerum laboriosam et et aut assumenda quos quaerat dolor qui enim quis itaque possimus et soluta quibusdam consequatur excepturi nulla sunt doloremque reiciendis et qui facilis vero animi consequatur odio a rerum aliquam voluptas nulla illo voluptate ut sed aliquid assumenda voluptatem sit id sed ut accusantium excepturi eum quia cupiditate iste quidem veritatis qui maiores error sit et perspiciatis maiores nihil consequatur eos facere mollitia architecto ipsa vitae sint labore reprehenderit nostrum tenetur exercitationem autem et sunt et culpa dolor voluptatem pariatur ex quod amet reiciendis modi placeat doloremque provident deleniti aut velit expedita.', '0', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
INSERT INTO `course_news` VALUES ('868', '5', 'Officiis et assumenda vero earum quia sed.', 'Voluptates non similique molestias voluptatibus voluptate voluptates iusto incidunt adipisci totam asperiores autem repellendus facilis et sint modi magni eligendi dolor fugiat quia deserunt distinctio autem dolores nobis ullam facilis vel voluptas aliquam consectetur tempora eligendi et et quia accusamus distinctio debitis non officiis rerum quis in qui consequatur quo ad exercitationem laudantium voluptas magnam commodi inventore praesentium sint rem aut harum sint culpa adipisci perferendis et et voluptate qui hic eveniet aut dolores repudiandae aut nihil autem non dolorem sed dignissimos harum eius deserunt quia et voluptate enim ullam consequatur non optio est consequuntur nulla sed enim quam rerum nisi aut dolorem sapiente maxime maxime molestiae illo porro recusandae quod tenetur expedita libero fuga qui aut assumenda perspiciatis eos enim assumenda mollitia quis eos cupiditate eaque asperiores nulla esse unde rerum aperiam in et excepturi tempore voluptatem quia omnis doloremque aut et quidem excepturi facere est illum ratione non earum velit natus rem sit adipisci quidem inventore aliquid velit ipsa qui quod fugit molestiae qui illo qui numquam voluptas eius sint doloribus velit sed iure praesentium error magni dignissimos aut esse vitae sunt exercitationem omnis aut optio repellat occaecati hic et tempora enim quod fugiat facilis maxime consequatur consequatur ipsa iusto aut et fugit debitis eum delectus maxime est dolore quia nihil suscipit molestiae et perferendis enim rerum tenetur quia quaerat et deleniti perferendis sapiente voluptas alias et velit soluta ex.', '0', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
INSERT INTO `course_news` VALUES ('869', '6', 'Dolorem eos quis explicabo autem.', 'Enim voluptatem dolor temporibus omnis optio culpa et ab voluptas incidunt exercitationem non inventore eum ratione officiis deserunt incidunt ipsam assumenda et aut voluptatum sed sit dolores aut voluptas quo harum neque expedita optio voluptates odit consequatur aut et et animi minima illo porro dicta quia accusantium eaque voluptatem molestias sit dolorem reiciendis totam corporis libero nihil nulla et debitis in dolorem consequatur aspernatur provident nihil ad rerum enim voluptatem placeat aperiam in asperiores sapiente dolores et sint ea molestiae id omnis eos consequatur veritatis amet nulla ut quis voluptas id soluta assumenda nostrum enim sit qui qui officia quia reiciendis velit minus vel voluptatem impedit occaecati ipsam impedit sed ut repudiandae vero ullam eos quia qui asperiores ab voluptas repellat consequatur et quasi ullam quasi aliquid ipsam voluptatum rerum voluptates ullam praesentium neque nihil aliquam quia quibusdam suscipit voluptatem quia unde ut ut enim quae voluptas quas aut non praesentium nesciunt voluptatem dignissimos excepturi aut hic voluptate reprehenderit eligendi harum minima eligendi eaque voluptate odit suscipit veritatis voluptas aspernatur ab doloremque optio error rerum in earum eos beatae velit magni aut exercitationem quia aut voluptatem quaerat temporibus sunt tempora ipsum quibusdam illum modi omnis ut accusantium delectus quasi dicta non sit consequatur animi laboriosam provident qui omnis natus voluptatem a quis accusantium natus ut nulla laborum impedit modi hic illum cumque libero quisquam alias dolorum sequi repudiandae laborum sint tenetur similique dolorum unde est commodi eum autem ea quasi et eligendi aut a excepturi eius optio libero consequatur aut autem qui quia necessitatibus quisquam aperiam nulla voluptates eos.', '1', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
INSERT INTO `course_news` VALUES ('870', '7', 'Consequatur nihil deleniti est.', 'Velit adipisci debitis et nam enim soluta enim rerum perspiciatis veritatis est et sint ex omnis laudantium maiores dignissimos vitae possimus culpa voluptatem est minima sint saepe deleniti quo magni aliquam odio occaecati nemo fugiat voluptas dolor voluptatibus tempore molestias voluptatem ipsum aliquid voluptatem aut molestias omnis laborum quod molestias autem amet aspernatur ullam qui ut aut sed molestias quis nemo iusto enim pariatur aut aut consectetur iusto molestiae aut nihil illo reprehenderit delectus laboriosam sunt sint magni id id sapiente deserunt omnis error corporis nam et architecto tenetur et sit culpa laborum provident est hic voluptatem aut ut adipisci fugit saepe ducimus ullam neque eaque quo facere a possimus et ex itaque delectus accusantium sed autem soluta aut alias non iste aut maiores qui iure tempore adipisci vel voluptatibus possimus eos quis qui sed ut ad eaque magnam sit est aut animi eaque porro mollitia similique autem ut delectus facilis quia aliquid nulla perspiciatis molestiae odio et et rerum ad numquam et incidunt porro ullam sed molestiae alias neque reiciendis temporibus perferendis iste aperiam fuga nemo impedit voluptas assumenda quam quibusdam harum magnam reiciendis laborum non itaque fugit adipisci quas qui excepturi cupiditate officia ut velit labore quo est expedita minus et odit ut tempore accusamus accusamus eius impedit eum molestiae quia cupiditate libero dicta exercitationem expedita quisquam incidunt mollitia sed magnam eligendi dolorum veritatis accusamus neque nemo explicabo aliquam occaecati quis natus quia incidunt modi ratione quibusdam ullam consequuntur reiciendis aperiam et dolores modi voluptatem soluta cumque qui quibusdam minima delectus dolorem possimus sunt error neque voluptatibus rerum voluptas expedita molestiae aut voluptas hic quisquam molestias dolorem sit sed inventore et non omnis mollitia eius nihil hic magnam.