INSERT INTO `course_news` VALUES ('871', '4', 'Sapiente unde corporis unde assumenda officiis quo.', 'Magni et est voluptatem sapiente suscipit omnis id quam voluptas ipsa ut voluptas ut ut eius sapiente placeat sequi et et eaque tempora ratione omnis vel quidem quidem suscipit quibusdam tenetur ea nulla facere quasi dolores consequuntur sint ullam commodi animi dolorum rerum officia alias libero dolorem similique cumque ullam quisquam dolor quaerat consequuntur eos molestias recusandae et perspiciatis voluptatum eligendi iste reprehenderit autem est fugiat nostrum laborum nobis magnam est rerum aut eligendi autem est ea vel eum voluptatibus voluptas unde qui vel reprehenderit mollitia eum rem et rerum autem inventore fuga quisquam qui et eius minus omnis repudiandae quisquam minima quaerat voluptatem itaque aperiam voluptatum sapiente laborum minima suscipit doloremque commodi consequatur laborum at quis blanditiis ut officiis atque enim illo minus quod at velit voluptatem harum at qui et laudantium delectus dolores animi voluptatum ratione qui hic consequatur quia sed iusto odit rerum exercitationem quasi odit iure rem assumenda consequatur iste voluptates recusandae veritatis voluptates neque magnam aut laudantium hic vitae ullam adipisci dolores voluptatem modi necessitatibus ut reiciendis quae accusamus est et quaerat neque laudantium dolorem natus et ut doloribus ratione vel aut officia explicabo eum maxime aut ut delectus officia dolor aut et voluptates itaque illo qui quaerat vitae qui dolore sint ea qui ut non magnam aliquam magnam alias quo modi blanditiis natus non recusandae et tenetur voluptatem non totam aut mollitia praesentium sint est rerum quos facere nihil distinctio quia qui reiciendis explicabo laboriosam magnam quisquam non eaque ex ut voluptate sit minima eos ut iste rerum consectetur aliquam maiores sapiente molestiae consequuntur perspiciatis cupiditate unde omnis sunt distinctio ut aut deserunt ea fugiat voluptatem animi quae quaerat conseq