INSERT INTO `course_news` VALUES ('872', '2', 'Dolorem ut et dolores eum.', 'Dolores nihil vitae et non officiis deleniti maxime odit debitis sit eos nesciunt iure praesentium magnam quidem ut error veniam omnis qui inventore quibusdam voluptatem est ut fuga nisi asperiores autem soluta voluptatem alias aut ut quod dolorum sunt molestiae cum ut ullam itaque minima nam alias dignissimos et ducimus et est autem molestiae qui aut dicta sit quia ullam sit unde non ut omnis voluptatibus laudantium minus voluptatem quia sequi et rerum non alias sapiente eaque possimus doloremque commodi eum cumque qui velit in nihil autem est minus minus pariatur voluptas impedit architecto sunt ut ipsa enim qui omnis soluta vitae sed excepturi tempora dolor consectetur similique provident veritatis ipsum architecto cum sed illo sapiente quibusdam ipsam excepturi enim quod iusto quidem hic corporis officia accusantium debitis et blanditiis similique itaque similique eaque cumque voluptas ratione nesciunt dolore a quam cumque ab quisquam perferendis velit animi delectus odio quia aut voluptatem rerum quo molestiae dignissimos reiciendis repudiandae fuga sint ut voluptas omnis laboriosam dicta atque iusto autem mollitia quia possimus consequatur fugiat maxime ullam vitae nobis tempore officiis libero aperiam facilis accusantium accusamus similique quisquam non quas repellat voluptatum facere id dolorum et eveniet laboriosam quasi autem praesentium veniam consequatur sed et explicabo et est aspernatur modi id aut nostrum accusantium culpa suscipit vero a praesentium laboriosam delectus consequatur error ipsam qui repudiandae non dolores nesciunt quisquam et reiciendis aspernatur occaecati quae dolorem sunt animi qui tempora id omnis soluta voluptatem id optio eveniet quia quos iusto dicta id doloremque dolor ut magnam temporibus ex dignissimos quisquam facere ullam maxime eaque illum qui unde voluptatem consectetur et esse voluptatum debitis atque qui et magnam et perspiciatis vel aut error 