INSERT INTO `course_news` VALUES ('873', '5', 'Sunt quia exercitationem ad rerum dolorem tenetur sit.', 'Eum mollitia dolorem eius recusandae est dolore nesciunt ipsam placeat cupiditate consequatur consequatur ad odit voluptate accusamus esse voluptatem ut dolorem ipsa quod dignissimos praesentium voluptas nemo beatae illo qui provident ratione numquam iusto enim est deserunt totam nihil dolores et molestias nulla veritatis sit explicabo officia sed exercitationem iusto est aut harum aut ex sit rem qui odio qui ea officiis repellendus velit id hic vel aut qui commodi est est excepturi fugiat reiciendis eos quia et quis rem alias labore molestiae et eum consequatur illo non inventore repudiandae dolor et voluptates et magnam voluptas architecto maxime nemo enim id deleniti consectetur dolores tempora suscipit aut quas quos alias numquam tempore laudantium vero mollitia dignissimos aut neque explicabo magni amet occaecati sed deserunt nemo est temporibus a sunt unde explicabo molestiae inventore et est necessitatibus voluptatem voluptatum ipsa autem provident dignissimos excepturi ratione similique nihil repellat debitis tempora tempore nulla minima rem maiores qui provident earum quisquam consequatur quia quia eum veritatis ex sequi doloremque et non neque ut sapiente aut et qui est qui delectus sunt officiis vero dolore excepturi modi est ex quos delectus deleniti nisi sit tempore praesentium voluptatem tempore possimus sapiente in tempora hic ab aspernatur occaecati distinctio rerum voluptate aut et neque voluptas voluptas eaque architecto a aliquid corporis et optio quia non eos corrupti sit possimus voluptas rerum laboriosam dolore autem eum eum libero sapiente quia eaque iusto et sint reprehenderit aut quam at corrupti quis unde illo at molestiae dolor sed dolores tenetur et fugit aut asperiores molestiae consequatur pariatur porro ipsa eum explicabo aperiam sunt consequatur nesciunt dolor accusantium quasi dolorem non est a saepe quo commodi quia repellat omni