INSERT INTO `course_news` VALUES ('874', '3', 'Corporis quia et sed facere quis harum aut aut.', 'Eum non molestiae reiciendis amet in necessitatibus ad iste aut et iste sit laborum eveniet accusamus impedit quos quibusdam libero non aut molestias repudiandae earum nobis sunt rerum et ut cumque aspernatur in iure enim ad totam ipsum ab quia et officia aut veniam aut laudantium culpa corporis autem aut numquam natus voluptas dolorem sed odit quibusdam dignissimos ad reiciendis et eligendi eum autem eaque quasi deleniti voluptatem voluptatem quia possimus natus eveniet nobis voluptas aspernatur ipsum accusamus aspernatur debitis harum dolor blanditiis minima mollitia esse voluptatem et repellendus ipsa molestiae et fugit ea neque dolorem nobis officiis facilis labore tempora cum tenetur fuga hic rerum a ut ut sed dolorem perferendis ratione reprehenderit voluptatibus est velit quibusdam quis sit dignissimos et architecto distinctio quo earum quasi rem fugiat rerum voluptas ut autem itaque animi qui ipsam et optio sint quis voluptas maxime illum ipsum ut repudiandae accusamus et autem et esse dolor debitis odit excepturi dolores occaecati ipsum repellendus quos enim aperiam omnis nisi provident aperiam voluptas accusamus voluptas omnis ut ea nostrum qui est est sed vitae voluptatem consectetur est officia et quia amet ratione eos rem rerum hic sed assumenda error corporis perspiciatis eum error ullam excepturi eos autem laudantium minima eaque quo perferendis dignissimos suscipit sunt inventore omnis unde voluptatem atque voluptatem sint laudantium est sapiente rerum delectus omnis et et placeat ea sed non minima quia ut ratione velit natus itaque quo magni omnis reprehenderit qui qui sint provident voluptatem cum asperiores minima ullam rerum facilis voluptatum aliquam illum cum recusandae dicta consequuntur odio occaecati sint voluptatibus quia dolores est nobis a inventore non nam nam sunt similique sunt eaque suscipit eius laborum nobis placeat modi animi error qui