INSERT INTO `course_news` VALUES ('875', '10', 'Quasi doloribus aut et nisi neque et totam quod.', 'Placeat sunt dolor temporibus excepturi ut exercitationem molestias harum odio odio sed omnis qui esse eum eos dolorum architecto voluptatibus voluptatem velit dicta omnis assumenda sed quo neque minus earum vero vel odio enim sequi et autem ut est rerum excepturi vel repudiandae placeat autem quaerat corrupti ab itaque possimus veniam minima voluptatem magni quam veritatis est itaque et earum est soluta sunt ab et nesciunt nam ut facere amet sit perspiciatis officiis et ipsa quam consequatur perspiciatis natus minus et occaecati eligendi omnis dolore quia ut ipsa sed sed sequi ut voluptas non error omnis accusamus ipsa reprehenderit quasi quod veritatis eligendi et voluptates placeat omnis est voluptatem et rerum est ratione in enim omnis eos corrupti dolores delectus molestiae enim excepturi minus ea sunt sit soluta nihil recusandae eveniet autem rerum sunt molestiae maiores quia eos accusamus ratione debitis iusto tempore alias est fugiat commodi eos corporis laborum officia id eveniet totam architecto ut voluptatibus et sed quam distinctio eius nulla error vel nobis iste omnis non in rerum ad tenetur maxime incidunt iusto ratione et eveniet in aut facilis sunt optio quia sit ad distinctio eos ut in rem ex unde non voluptatum iste mollitia perferendis nostrum enim quis excepturi temporibus fugit in alias temporibus occaecati repellat ut ipsam saepe cumque tempora animi laboriosam minima vero quia id iusto aut itaque laborum cum ullam non vel.', '1', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
