INSERT INTO `course_news` VALUES ('877', '2', 'Placeat voluptas nisi quas nesciunt commodi id et.', 'Dolore amet eius aut consequuntur culpa dolores qui dolor qui in vel sapiente qui quia non ut esse aut perspiciatis velit veritatis quis sed nihil praesentium debitis iure deserunt id ab dolorem aut ea eos ad quibusdam reprehenderit vero iusto non odit saepe at magni excepturi sed dolores non eum hic aut quis quasi repellat quia deserunt eos animi qui cum ratione dolores repudiandae voluptate quaerat facere debitis voluptatem ratione atque non cupiditate reprehenderit at mollitia quia eaque provident distinctio impedit aut sunt harum iste dolor eum occaecati quia esse tempora ex commodi unde natus odio sequi quibusdam perferendis unde eaque quia saepe atque eum in ipsum sed consequatur earum libero beatae eveniet nihil adipisci cupiditate cum aut tempora expedita ut laborum sunt est pariatur qui et placeat earum recusandae rerum et laborum accusamus iusto aut rerum perferendis nisi neque id at in saepe sit eaque dolorem aperiam non necessitatibus repellat nemo in qui consequatur quia dolores sint voluptas reprehenderit delectus vel quos consequatur qui commodi ipsa sed at corporis suscipit pariatur ut dignissimos officiis sed ab dignissimos sit quis velit et laudantium alias sit corrupti dolor facere quod non illo deleniti necessitatibus dicta deleniti ut autem itaque nihil eos sit ea exercitationem totam architecto corporis et voluptatem sit quia enim adipisci eos voluptatem aut maiores quod commodi dolorem voluptatem assumenda quas natus totam ut rerum quia et adipisci omnis dolor asperiores beatae enim fugit dolores sit dolores beatae qui et a harum aut maxime corporis alias est dolor eum consequatur eos aut dicta dolores tempora quibusdam temporibus exercitationem quos at amet quis aut nostrum ut nihil esse doloribus dolorem molestias accusamus ipsa quos sed quasi maxime quisquam nisi doloremque nihil doloremque tempore laudantium nam omnis saepe perferendis saep