INSERT INTO `course_news` VALUES ('878', '7', 'Omnis quae aut id sunt.', 'Voluptatem quia reprehenderit iusto inventore quo aut consequatur quo mollitia fuga fugit nobis numquam omnis aliquid autem in vitae eius laudantium enim ducimus consequatur qui quia aut nemo officiis maiores enim ullam quaerat doloremque ut dolore adipisci eius aliquam velit sed sed vel rerum optio perferendis ratione dolore hic maiores accusantium ea et possimus recusandae est debitis ea fuga dolore dicta enim vitae voluptates voluptatibus omnis et qui laudantium voluptate eaque tempora sunt explicabo mollitia sed est debitis alias corporis eos quia sed praesentium error harum provident recusandae in fugiat voluptatibus sequi assumenda voluptate vero consequatur ut nemo autem magnam at aut nihil qui praesentium vero repellendus assumenda quod occaecati animi error recusandae amet ea cum veritatis quia magnam quia excepturi tenetur non quo et aliquid molestiae quia et mollitia ab qui ea amet sunt qui eos et quod repellendus qui ex aliquid ullam hic repellendus asperiores similique architecto nulla qui sed nihil inventore nihil autem ut cumque aut omnis porro sint quibusdam error sed repellendus omnis ipsam perferendis consectetur aut consequatur nihil ducimus molestiae et est dolores optio quae rem nesciunt repellat qui id et rem et sed deserunt culpa id molestiae excepturi dolore ad aliquid quo voluptas sit et eius tenetur consequatur blanditiis.', '1', '2017-05-02 22:59:36', '2017-05-02 22:59:36');
INSERT INTO `course_news` VALUES ('879', '10', 'Rerum consequatur temporibus animi nam dicta.', 'Non iusto cum quidem voluptatibus sit exercitationem et repellendus asperiores et nihil laborum molestiae vel ab similique natus aliquid omnis animi reiciendis incidunt velit cumque veritatis excepturi et quas ullam quasi ratione fugiat officiis iste voluptatem sit occaecati ut numquam et in eum error ipsa quia dolor qui alias quis ad quidem asperiores neque quia et alias velit pariatur est voluptatem non harum est ratione accusantium laborum velit ipsa qui rerum maiores laudantium non dicta quo aliquam id natus commodi sit velit ut aliquid et animi voluptate ut voluptas facere at ut et et culpa aliquid error ipsa ipsa sequi quia consequuntur accusantium est ex provident repudiandae aut autem labore eaque omnis quia officiis doloremque asperiores voluptas veniam nostrum praesentium inventore voluptatem itaque vero soluta nisi atque culpa enim delectus laboriosam animi ut sit suscipit aliquid aut excepturi alias qui magni voluptates eveniet ea voluptatem sapiente quidem voluptate voluptate sed reiciendis vero voluptatem veniam blanditiis error rerum dolorem dolorum pariatur rerum odio ipsa deleniti qui veritatis minima aut officia iusto deserunt blanditiis quia rerum sed sit est libero omnis vel velit architecto ut quis nam quia veritatis corporis voluptatem odit nisi voluptatem corrupti vel vel in aliquam asperiores fuga rerum aspernatur facilis dicta beatae accusamus rem nihil exercitationem temporibus qui pariatur dolorem a officia quo placeat harum sint molestiae consequatur et ullam aut id dolor labore corrupti dolor eius cumque incidunt excepturi possimus beatae vel placeat et in in consequatur sunt consequatur voluptatum ea sequi dolorem inventore sint veritatis est odit eveniet aut iusto quod atque velit doloribus modi dignissimos amet iste quia voluptas consequuntur vel recusandae suscipit qui eum laboriosam vel ipsam voluptate corporis modi repudiandae ducimus a