INSERT INTO `course_news` VALUES ('880', '9', 'Aspernatur autem ullam exercitationem occaecati.', 'Ut tenetur adipisci qui optio fuga aspernatur in eum assumenda voluptas molestiae ut aut quidem et sed ab autem et deleniti id illo sequi voluptatem earum asperiores commodi ducimus maiores quia et illum consequatur voluptas blanditiis porro nisi possimus ut perferendis sed adipisci totam magni enim velit sed non saepe dolore suscipit temporibus quia odit voluptas eum veritatis explicabo natus et velit autem soluta ut sint iste quaerat laudantium qui sed aut assumenda qui eum dolor itaque distinctio quo ea consequuntur fugit deserunt quisquam expedita iste cupiditate consectetur est cupiditate et voluptates odit in voluptatem distinctio et atque tempora ut natus expedita ut sunt dolor earum cumque fuga voluptatem et eum temporibus at dolorem sit nisi quibusdam error et ut ipsa magni aut cupiditate quidem molestiae omnis earum id odio possimus ut itaque molestias officia cupiditate ratione repudiandae perferendis voluptas id fugit error sit quam cumque consequuntur et voluptatem et accusantium voluptas aut odit illo ratione dolores inventore fugit magnam error quos distinctio enim consequuntur fugit repudiandae sed natus quos accusantium quasi dolores architecto atque eum recusandae assumenda velit molestiae nam eum vel provident vel aut quibusdam sequi enim consequuntur non reiciendis ratione aut iure nulla possimus possimus maiores voluptas aut quia praesentium ab hic ab ea quia veritatis voluptatem nihil qui ad repellendus eaque esse veritatis voluptatem autem ducimus nulla illum deserunt sint quos eum facilis nobis et deserunt quia numquam placeat tempore perferendis quo dolorem sed repellat magni exercitationem natus quaerat voluptatem maxime incidunt ut rem qui reprehenderit reiciendis distinctio blanditiis molestiae minima qui explicabo tempora sint qui aut quam consequuntur exercitationem amet quidem illum aut et eos doloribus quisquam sint rerum consequatur dig