INSERT INTO `course_news` VALUES ('881', '5', 'Recusandae quia molestiae omnis ut.', 'Illum maxime cumque magni aliquid deleniti nisi aspernatur omnis adipisci expedita porro nihil eos voluptas reprehenderit non omnis tempore sed iusto enim est incidunt aliquid porro similique ut quis voluptate repellat et saepe dolor nihil voluptas distinctio maiores est ipsum nam ut voluptatem asperiores quaerat dignissimos inventore excepturi facere est aperiam perferendis repudiandae ducimus qui deleniti dolor distinctio eveniet velit assumenda voluptas ab iste ut et natus nostrum dolor debitis suscipit vitae pariatur eaque qui explicabo est vero iure dolore a voluptas distinctio tempore est recusandae amet sit quae numquam hic architecto odio velit magni est doloremque qui ut qui et blanditiis earum blanditiis quam corporis aperiam architecto animi vel est officiis aut esse aut maiores dolorum eos odit error dolor facilis modi aliquam nisi ullam sed dolor molestias vero ut dolorum tenetur voluptas fuga voluptatem maxime aspernatur est libero sapiente minus similique ad blanditiis perferendis voluptatem a eum id provident aliquid nihil assumenda dignissimos nobis fugiat molestias ut doloribus aut ut iure quam itaque ut iusto optio a et nostrum quis et sit ipsum nihil ullam quibusdam et exercitationem quod velit atque ullam quaerat omnis sit velit blanditiis et voluptatem minima ipsam et autem omnis sint molestiae perferendis nesciunt similique dolorem quod sed et est rerum suscipit voluptatem quas iure voluptas eligendi aut beatae quasi sint et qui ratione nesciunt aperiam dignissimos et mollitia esse sapiente et voluptatem corporis molestiae voluptas nesciunt itaque quaerat aut mollitia ea rerum est cumque rerum ducimus accusantium repellendus et nam sapiente qui hic omnis sed autem esse quas doloremque veniam temporibus aut repellat nobis qui voluptate sed nam iure commodi consectetur corporis quia illo molestias laboriosam consequatur doloremque suscipit eligendi consequatur 