INSERT INTO `course_news` VALUES ('886', '5', 'Laboriosam quam quia rerum cum similique architecto ullam.', 'Qui sit quam ex minima et quo sit dolores maxime ut beatae ducimus mollitia voluptas ullam eaque libero corrupti vitae quis quasi earum et distinctio dolores sapiente nam quos veniam expedita voluptatem architecto aut cumque et excepturi aliquam beatae voluptatum eos placeat dolores nemo minus ut rerum deleniti sit rerum qui id enim aliquam velit nostrum sed id odio molestias impedit voluptates adipisci ab beatae quibusdam vitae magnam sit nisi doloribus recusandae ullam voluptate aspernatur voluptate veritatis non nesciunt dolorum magni omnis qui hic sed a neque cumque non qui ipsum adipisci et odio enim quos hic exercitationem ea atque animi qui qui vel expedita commodi quidem ut consequuntur alias qui molestias explicabo illum magni et alias tempore cum perspiciatis quasi voluptatibus quasi provident molestias occaecati omnis cumque porro magnam tenetur aliquid maxime cumque et architecto voluptatem non quo explicabo alias nihil quidem voluptas necessitatibus necessitatibus ab voluptatem totam est totam quidem aut nemo aspernatur sunt porro animi consectetur et mollitia neque sint officiis impedit enim necessitatibus totam cum omnis numquam sequi mollitia corporis quia ut ipsam ut ducimus et sint exercitationem facere itaque cum dolorum qui illum natus temporibus et ut dolores voluptatem omnis commodi quod quia quam officia consequatur sint et neque dolorem sed et id ullam at veritatis nesciunt ea eveniet ut quos ex autem voluptatem et ea quis recusandae ea labore optio hic fuga illum iusto labore ratione.', '1', '2017-05-02 22:59:37', '2017-05-02 22:59:37');
