INSERT INTO `course_news` VALUES ('890', '7', 'Expedita nesciunt ea magni et magni vel.', 'Et quaerat quia vitae libero assumenda eum est quos velit quia quidem repudiandae consequuntur dicta sed saepe voluptatem accusamus expedita dignissimos labore fugit sint laborum architecto dolorum velit quo doloribus delectus omnis id velit fugit culpa dignissimos nisi possimus sed nostrum aut corrupti reiciendis accusantium doloribus dolor quis culpa cum asperiores veniam fugit natus et aut sapiente aliquid dolor excepturi officia vel ipsa quia hic omnis illo sequi eum est voluptate sed voluptas aperiam in voluptatem et et sed ea at ut aspernatur sapiente officiis dolorem ut amet cupiditate et molestiae voluptas sunt rerum enim ut veniam at omnis et quis odio error repellat ut quidem repudiandae odit dolor velit modi quas porro tenetur ratione velit quis omnis minus voluptates aut incidunt mollitia veniam mollitia esse quia amet quam iure minima illo nesciunt quo illum corporis amet eum laudantium ut cumque repellat excepturi commodi natus expedita occaecati atque quidem cum ipsum non odit eaque aliquid veritatis animi labore omnis nostrum quaerat non est vel officiis animi ipsam ea fugiat laboriosam rerum quo dolore saepe eos ab corrupti voluptatem eaque neque porro a aut deserunt quis est voluptas consequuntur incidunt illo hic excepturi cupiditate accusantium eum alias aut ipsum soluta dolor aut veniam id consequatur omnis doloribus quia dolores doloribus quis architecto debitis non libero maiores delectus quos sed velit error alias nam est sit nihil dolorem et non corporis a dolorum vel harum voluptatum accusamus itaque natus consequuntur repudiandae et adipisci dolorem cum ullam nulla expedita sed ut quod non eveniet doloremque eligendi placeat qui ut commodi exercitationem omnis et voluptatum rerum dolores eius quae non alias fuga est cumque necessitatibus et laudantium sapiente vel dignissimos sed est necessitatibus dolore sit amet culpa voluptatem necessitatibus simi