INSERT INTO `course_news` VALUES ('892', '2', 'Iste architecto sit maxime consequuntur.', 'Iusto corrupti molestiae omnis atque facilis qui commodi voluptatem quis ut quo rerum dolorem consequuntur et quisquam magni deserunt eaque voluptatem sint nulla deleniti hic et dolorum enim atque impedit doloribus quia aliquid nam id iste sunt nesciunt doloremque quo omnis voluptatem sed voluptatem eum sed rem quis non fugiat consectetur sunt itaque corporis facilis ut dolorum libero dolore odit magni quia impedit sit ducimus et tempore eum rerum cumque dicta perspiciatis dolores dolorum accusamus aperiam consequuntur recusandae omnis ut quia odio minima quasi et similique deleniti non facilis excepturi inventore aut quia repellendus minus dolorem quis odit doloribus temporibus accusamus optio et voluptate commodi qui repellat totam cum laudantium quo odit consequatur ipsam dolor sint temporibus autem omnis nisi voluptatem amet aliquam ab maiores impedit aut voluptate et praesentium neque quia quia qui a magnam quia earum qui totam quis rerum inventore molestiae maiores quidem quae voluptatum molestias dolore nulla nemo sed sit minima temporibus facere velit aut rem corporis autem vitae cum aut corrupti id incidunt magnam qui architecto nobis velit recusandae deleniti ad cupiditate quos dicta aliquam laborum quaerat assumenda dignissimos a porro consequatur repudiandae debitis sunt ea qui et nostrum tenetur ut consequuntur natus quia dolor eum non mollitia dicta deleniti at iusto temporibus qui sed dolor cum maxime quo pariatur illo eius ipsa aut a vel dolor ea quae ad ratione eveniet deleniti ducimus labore velit doloribus beatae quia est fugiat aut pariatur veniam ad quod aut officiis vitae neque eos possimus eum rerum quaerat sit id ex porro vel fugit numquam aut ex hic numquam consequatur earum temporibus doloribus deleniti totam quod maxime animi corporis aspernatur explicabo et adipisci dolores dolor maiores quia temporibus nam neque dolorem laudantium labore officia op