INSERT INTO `course_news` VALUES ('893', '9', 'Voluptatem reiciendis perferendis quia adipisci et eius.', 'Soluta impedit omnis magnam voluptates ut officia et quos velit repudiandae enim ut qui reprehenderit provident sed rerum consequatur corrupti quae dignissimos aut ea ut maiores eum recusandae recusandae eos repudiandae ut natus quae sint fuga eum omnis qui fuga inventore fugiat accusamus necessitatibus animi excepturi ullam nisi quia fugiat vero asperiores occaecati deserunt voluptatibus impedit consequuntur minus ipsum aut et deleniti repudiandae alias in architecto ea enim velit quisquam consequatur dolor beatae delectus ut possimus molestiae laboriosam id earum labore suscipit aperiam ut autem aperiam labore similique voluptatem sequi consectetur quibusdam ut animi est asperiores ipsam a molestiae quo ad aut et sit dolores optio mollitia id ducimus eos sunt neque tempore rerum ad asperiores aut eum adipisci eum eius animi dolor ut officia eum maiores minus eos tempora porro tempora consequatur quia possimus necessitatibus blanditiis maxime quas vitae velit numquam sequi consequuntur unde architecto quas non voluptatibus voluptatibus ut sed reprehenderit perspiciatis velit doloremque et consequuntur sed facere ad distinctio perspiciatis ipsam quia necessitatibus cupiditate incidunt sint tempore itaque ratione inventore et beatae perspiciatis aut et ab laudantium ullam ut et debitis et vero aspernatur aperiam veritatis autem perspiciatis non dolor magni rerum id ut et perspiciatis qui quasi consequatur veritatis aut quo ipsam amet aspernatur dolores nulla itaque quasi aut quae facilis molestiae ut et illum non et aliquid et repellendus dicta in dolores omnis inventore sed est explicabo dolorem nemo asperiores repellat aut vel amet excepturi est temporibus qui nesciunt eaque magnam qui illum quia ullam ut ipsam quibusdam distinctio recusandae nihil at maxime sunt ex qui rerum totam facere dolore molestiae architecto reprehenderit repellendus illo ab et accusam