INSERT INTO `course_news` VALUES ('894', '9', 'Non similique nesciunt quis et dolor et fugiat.', 'Pariatur autem numquam fugit repellendus enim est ut id architecto vel ex veniam hic aut sit beatae autem atque porro eum odit est deleniti a eveniet qui consequuntur nemo culpa consectetur et rem corporis velit fugit omnis aperiam iusto consectetur quos eum commodi et voluptatem totam harum mollitia est suscipit perspiciatis omnis corporis quidem vitae et est ea voluptates voluptatem dolor labore commodi magni molestias placeat ab aut et velit odio voluptas error possimus dolores earum aut vel deleniti sit qui dolor necessitatibus qui nostrum neque incidunt consequatur suscipit laudantium dolore quisquam amet tenetur tenetur facilis eligendi est adipisci saepe quasi qui enim dignissimos aspernatur quasi commodi maxime delectus laboriosam voluptates temporibus maiores eos qui voluptatem enim illum est illum reprehenderit iste recusandae sed minus aspernatur ut suscipit praesentium ut quo mollitia ipsam rem saepe ipsum recusandae sint nihil occaecati quibusdam nisi ullam voluptatibus alias laborum vitae nihil nisi incidunt sequi autem est laborum quod aperiam sequi non sit aut aut quia ipsa eum modi quisquam ut et quia ullam pariatur repellendus necessitatibus voluptatem atque libero blanditiis reiciendis eaque ipsa ut ad provident quam quod voluptas facilis et at id et quia est enim aperiam quaerat eum debitis repudiandae provident voluptatibus veniam maxime illum velit doloribus in temporibus sit nihil voluptatem unde atque sint.', '0', '2017-05-02 22:59:37', '2017-05-02 22:59:37');
INSERT INTO `course_news` VALUES ('895', '8', 'Repudiandae totam non maiores sunt pariatur.', 'Voluptas accusamus repellendus ut tempora atque quia est sed quasi non ullam dignissimos id officia ut ut error fugit ipsam omnis a et dicta et amet nam est cumque et officia qui accusantium esse molestiae et accusantium atque sed ex vero eos voluptatem qui ut corporis eaque non et voluptas vel et praesentium quod repellendus optio voluptas quas enim odit illo quod eaque cum necessitatibus saepe sit dignissimos repellendus dolor dolorem minima at in nulla incidunt nihil officia aut aperiam hic iste et distinctio et eum architecto quibusdam molestiae quaerat at autem maxime deleniti reiciendis sequi eaque qui aliquam sed sapiente fuga error dolores ex veniam est perspiciatis sed tempora iste enim dolor totam eligendi molestias voluptas aut deleniti explicabo id perspiciatis qui praesentium quidem hic soluta debitis rem tempora corporis nulla vel amet aut velit distinctio similique quam et voluptas illo fuga eligendi corrupti dolore ab explicabo ipsam et qui enim modi et laboriosam sint nesciunt recusandae quas blanditiis eveniet dolorem voluptatem optio animi veniam tempora ullam quaerat assumenda sunt mollitia incidunt non provident non et suscipit eligendi tempora odit nobis veniam cupiditate in voluptas reiciendis corporis natus nihil nihil sapiente quasi minus quas placeat unde sapiente porro hic a neque tempora consequatur sapiente voluptatum voluptas et iste dolor nisi provident architecto provident ratione ut sunt corrupti eveniet sit labore occaecati dolorem sit rerum assumenda delectus inventore ullam nobis eos et cumque minima eius laudantium sunt modi ratione quidem architecto est aut libero eligendi veritatis eum voluptatem alias ut nisi perferendis accusantium debitis perspiciatis vero occaecati possimus minima aspernatur omnis et est dicta accusamus inventore nobis dignissimos deserunt ipsam totam illum similique veritatis dolorem reiciendis eos et rerum asper