INSERT INTO `course_news` VALUES ('896', '3', 'Aperiam sed nam commodi.', 'Provident quis voluptas libero non eos omnis consequuntur harum iusto ea sit voluptatum placeat quibusdam sint quis dolor nisi saepe quis et quam autem voluptatem et ipsa distinctio sit est possimus et quia iusto cupiditate ut vitae et voluptatem alias est inventore optio deleniti porro aut quia consequatur reiciendis odit saepe ipsam aut quo quo dicta impedit qui fugit deserunt ut fugiat reprehenderit sunt molestiae voluptas architecto reiciendis ut quia voluptatem nihil sapiente aut quasi dolor ut quis aperiam voluptatem qui aliquam inventore repellendus illum aperiam mollitia quo illo velit consectetur dolorum fuga qui sint est illo laborum in qui veritatis voluptatem laboriosam et rem porro animi architecto quisquam officia corrupti voluptatem esse illo quae illum quas fugiat aut impedit architecto saepe quo voluptatem voluptates accusamus tenetur perspiciatis facilis rem sapiente sit velit iusto atque maxime non fugiat sed et eos illum distinctio cupiditate quam omnis ab rerum molestiae numquam et quisquam provident incidunt qui labore vel delectus sit consequatur iste tempora nesciunt sint illo sit in soluta non ut consectetur qui qui ea et qui atque architecto totam aut nam porro beatae quis fugiat enim repudiandae praesentium non voluptatum iure qui eos est repellendus quos quas voluptatem ab libero repellendus et veniam aut sed voluptas ipsa voluptas modi rem earum aliquam dolorum et voluptatibus dolorem natus qui odit tempora blanditiis quisquam repudiandae non eligendi id neque recusandae autem vel similique sint voluptas quibusdam est atque inventore possimus dolores placeat placeat quos id consectetur magnam consequatur atque ut fuga ipsum labore aspernatur dolorem repellat reprehenderit aut ea velit dolorem ut dolore nesciunt temporibus minus error assumenda quisquam quia deserunt natus eos ipsa consequatur qui provident quia blanditiis exercitationem et eum dolores consequatur commodi magnam corporis doloribus vel in laborum eum occaecati tempore minima impedit quibusdam rem quibusdam vero labore autem et ex ullam aliquam illo temporibus consequatur sed ipsum et soluta beatae aut ut beatae a architecto impedit delectus in dolor dolorem quod voluptas suscipit libero ipsum nihil molestias doloribus optio saepe facilis non illo culpa sunt et praesentium in rerum dolorem numquam aliquam amet eveniet perferendis tenetur dolor.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('897', '2', 'Non ab ullam illum temporibus et.', 'Enim voluptate aut nesciunt qui incidunt excepturi omnis nihil eius dolor et architecto qui dolor inventore ipsam voluptatem quia qui repellat est aut neque aspernatur enim eaque praesentium nihil ut praesentium eius animi ut veniam est ullam expedita aut dignissimos facilis qui architecto omnis quaerat soluta perspiciatis impedit enim aliquam assumenda sapiente voluptas architecto nemo deserunt qui totam voluptatibus veniam dicta delectus qui quam saepe est maiores ea cumque consequuntur similique autem aliquid rem ut mollitia ab ea earum eos voluptatem ad sapiente autem est maiores voluptatibus deleniti itaque laboriosam ab dicta facere impedit sed magni perspiciatis distinctio minima quo quis ad est sint repudiandae illo sunt deleniti est aliquam error voluptates velit soluta nisi commodi laborum nisi molestiae tempore ea delectus et aut ut rerum minus ad est libero similique reprehenderit non fugit maiores rerum quibusdam et sed ullam porro eos itaque est non mollitia saepe mollitia doloremque maiores et corporis excepturi minima labore quo aut a corporis reiciendis dignissimos a ad id unde magni alias non harum quia nihil laboriosam eaque sunt ipsa esse ut asperiores numquam sit molestiae accusantium quo atque.', '1', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('898', '5', 'Tenetur architecto voluptate enim corrupti earum.', 'Consectetur doloremque consequatur officiis sed quia illum rerum natus molestiae quo sed vel porro possimus error nesciunt illum hic dolore nobis odio consequatur blanditiis id nostrum consequatur vel possimus eum laudantium autem veritatis minima sed soluta consectetur ipsa exercitationem veniam vel odio ipsam recusandae adipisci rerum doloremque ut id tenetur ut et sequi et rerum modi repellendus officia id aut aut ex ut nostrum et voluptas tenetur dolor cum vel qui soluta porro mollitia esse incidunt alias quam cumque explicabo dolorem suscipit similique accusantium dolorem debitis laborum enim eos ea maxime odio rerum molestiae repudiandae et perferendis porro pariatur sapiente doloremque ipsa provident vel dolore est velit iure nihil sunt eos rerum nesciunt a quisquam dolorem officiis sed nobis temporibus a maiores itaque ullam rerum aspernatur esse sint autem quaerat alias et sunt a optio laudantium voluptatem hic quam consectetur cupiditate repellendus deserunt sint aut non totam reiciendis perferendis exercitationem exercitationem qui aliquam fugiat unde perspiciatis ut dolorem dignissimos rerum odio nobis error ut maxime quia cum praesentium rerum et ducimus eligendi itaque qui consequatur sit impedit dolore et consequatur laborum minus similique ea.', '1', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('899', '7', 'Earum facere exercitationem deserunt et suscipit.', 'Sint quia dolores non maxime corporis quia ad natus harum ducimus ea dolores vel minus iure ipsum fugit enim nobis dolor ipsum quam impedit veniam enim repellendus facilis dolor similique consequatur molestiae dolor provident accusamus cupiditate accusantium minima ut amet harum distinctio temporibus quia aliquam et ea quia harum nihil voluptatem voluptatem iusto officia officiis ut sit blanditiis fuga veritatis corporis earum nemo eaque nostrum totam sed omnis nihil earum deserunt ea consequuntur voluptatibus ut itaque dolor error sed nostrum rerum cumque ipsum voluptates occaecati exercitationem quidem et mollitia rerum et qui minus voluptatem et odio molestiae dolor consequuntur sed et earum dignissimos earum aperiam aut earum dolores odio enim excepturi architecto molestiae dolorum deserunt ea porro quos in quia suscipit eligendi esse qui deserunt voluptatum voluptates aspernatur dolores dolor voluptas dolorem iste sed in enim blanditiis iure totam iste ut ipsa minus rerum rerum recusandae voluptas est aliquam natus ad qui voluptatem amet consequatur iusto illum esse impedit nihil velit aspernatur aliquid eum vel qui ipsum laboriosam aut suscipit sapiente omnis impedit earum iusto quidem quia id fuga modi sed veritatis error et in temporibus perferendis facilis rerum cumque id assumenda soluta ea nostrum architecto ut velit pariatur voluptatem praesentium quaerat reprehenderit nam aperiam ullam consequuntur numquam adipisci ut repellendus corrupti ut odit consequatur cupiditate doloremque debitis nihil consequatur laudantium vel ratione quidem sunt expedita esse fugit aut qui et dolor excepturi et delectus consequatur similique sint.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('900', '10', 'Voluptatem deserunt eius nostrum rerum rerum et.', 'Qui dolorum sed iste veritatis molestias repellat et optio voluptatem corrupti earum aut dolorem quod autem odio ipsa sint modi quam quod quia sunt ab illo cum in iusto odio esse provident nobis quia laudantium at qui quis id ipsa a et delectus facilis laudantium quo aut consequatur magnam qui tempora nostrum optio aperiam illo sed eius doloremque facilis ducimus et autem quas odio commodi possimus impedit ducimus ut porro sed cum vero ut sunt officiis aut iusto earum nemo in sit saepe iusto dolor molestias asperiores et omnis voluptas ut est qui voluptas repudiandae sed quidem sed laudantium repudiandae placeat et eius est veritatis et in nostrum et nesciunt fugiat aperiam perspiciatis soluta itaque et id sunt aliquam necessitatibus similique explicabo modi ea eos voluptate et temporibus vero corporis similique voluptatem optio quia praesentium quidem sunt asperiores est eveniet nemo quaerat non nobis maxime sapiente doloribus quibusdam suscipit voluptatibus eius pariatur explicabo ut possimus modi rerum vel numquam rem ipsa sit dolorem et necessitatibus error dolorem dolores ut excepturi quibusdam asperiores molestias et quo optio tempore et soluta asperiores accusamus architecto quidem temporibus.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('901', '5', 'Vel rerum quidem pariatur consectetur dolorem aut culpa.', 'Atque hic rem perferendis ratione quos quas odit placeat minima doloribus debitis consequatur fugiat blanditiis ut occaecati repellendus et explicabo unde reiciendis praesentium distinctio praesentium neque quia quam exercitationem eos harum est doloribus molestiae quia explicabo minus est odit voluptatem et error perferendis aut molestias omnis asperiores nesciunt sit eaque iusto autem reiciendis est a sint dolore quos perferendis animi dignissimos sed est nulla voluptatem voluptates voluptas necessitatibus pariatur possimus ducimus enim quia voluptas quo sint libero nam expedita aut qui corporis in labore architecto molestiae est exercitationem ipsam eius a asperiores consequatur quas vero tempore qui expedita consequatur et ea tenetur harum ea minima aut quam id aliquam qui quo in iure rerum et impedit cum aperiam sint voluptas vel et ducimus similique sit voluptatem beatae facilis ullam est fugit saepe libero inventore nulla illum aspernatur voluptas reprehenderit ut distinctio voluptatibus quis occaecati quidem deleniti vero ut impedit magni dolores voluptatibus aliquid impedit doloremque deserunt nihil ut distinctio esse quia vel sunt error corrupti nobis omnis qui perspiciatis libero voluptatibus et quaerat nesciunt voluptas itaque sit quia quam laborum dolor et temporibus quia qui repellendus ipsum sit quam optio praesentium itaque distinctio distinctio nihil voluptas laudantium commodi beatae at quia sunt occaecati saepe vitae vel voluptas placeat reiciendis aut animi sed deserunt molestiae voluptatem explicabo est animi repellat sequi incidunt fugit et voluptatem ea unde in eos culpa et ratione temporibus veritatis eos dicta fugit alias quo voluptatibus est aliquam nemo repellendus minima magni at quibusdam quia sint magnam voluptatem repudiandae eveniet perspiciatis aut assumenda eos ipsum provident dolorum corrupti quisquam saepe et similique modi q