INSERT INTO `course_news` VALUES ('902', '4', 'Quae quos animi delectus.', 'Occaecati itaque non odit non eaque odio dolores illum perferendis maiores sint magnam sed quidem debitis et quo quaerat atque est voluptatem vel quia ut necessitatibus aut dolor et fugit ea minus et corrupti voluptatem soluta optio odio accusamus itaque ut autem autem ab neque ut ipsum nisi quia ea aliquid ipsa voluptate et quia natus aliquid alias est corrupti temporibus omnis nam deserunt velit et laboriosam repellendus maiores corporis iste ipsa veniam quis quo voluptas tempore quaerat nisi magni odio explicabo non atque qui et totam aliquam sapiente minus repellat ea et assumenda dolor qui molestias nulla repudiandae molestias ipsum dolores vero similique perferendis in assumenda qui quod rerum nemo optio corrupti quaerat iusto assumenda est assumenda molestias ut ut aliquam saepe corrupti eius beatae facere rerum sit recusandae eos commodi excepturi voluptas nemo aut quia quaerat et in provident maiores libero et velit dolorem ratione vitae quo est assumenda deserunt earum quia maiores tenetur suscipit doloremque earum quas voluptas eum quis iste animi quo voluptate iste natus modi est et velit eius enim iusto qui error placeat sint architecto placeat incidunt quaerat illum et et vel maxime soluta reiciendis pariatur vel et reiciendis et voluptatum quia sint aliquam pariatur cumque velit odit incidunt veritatis et commodi architecto necessitatibus ipsa maiores est possimus quia sed quia id et neque similique nobis quae veritatis iste ipsam optio reprehenderit sed nemo est ex autem ex numquam veniam consequatur odit ea voluptatem ea animi laudantium ut accusantium et quos hic qui veniam reprehenderit eos quaerat aspernatur dicta similique facilis nihil eum dolor pariatur aliquid ut corrupti aspernatur in rem ut sunt minus omnis enim consequatur consequatur vero esse magni laborum voluptatem deleniti ab dolorem ut aspernatur perferendis qui et officia sit dolor earum sapiente exercitatio