INSERT INTO `course_news` VALUES ('903', '9', 'Aut quod quo pariatur voluptatem debitis.', 'Nihil commodi minima neque sint ut optio vitae iste harum itaque id aut beatae quasi eaque minus quod nam et consectetur deleniti unde quia recusandae vero non omnis fugiat aut tenetur reprehenderit et ut neque distinctio nulla quae qui incidunt voluptatem accusantium blanditiis hic aperiam maiores asperiores quam est ex quibusdam saepe dolor ut enim exercitationem qui nam perspiciatis nam quasi dolorum voluptates et amet non qui dolores hic laborum corporis officia ea eum quidem repellat quo non illo ipsa aspernatur ut earum dolorem non molestias quis delectus tenetur qui in quae molestias explicabo quia aperiam ex aut culpa sit aut ut et minus dolor consequatur in tempore asperiores at neque laborum in quidem nesciunt architecto odio quo iure suscipit voluptates deserunt qui tenetur laboriosam quos et fugiat cumque culpa repellendus ea quia culpa voluptatem laborum unde quia nobis rerum ab laudantium totam eius esse voluptatem voluptatem occaecati aliquid aliquid et et nam architecto id voluptas ducimus consequatur nemo ipsum numquam fugit qui recusandae quia nihil culpa voluptatem adipisci velit laudantium quasi ad dolores non et voluptatem excepturi qui optio et et soluta vel illo cupiditate officiis dolorem optio vero pariatur vitae recusandae excepturi ab assumenda qui sed autem odit et ea fuga perferendis esse sunt blanditiis doloremque suscipit et voluptatum eaque dolorum quo veritatis earum est eum quibusdam et commodi quia amet in nobis et quam quod eligendi quibusdam quia impedit omnis beatae id rem fugiat porro et dolore nulla debitis ipsum id nam nostrum harum et ipsa sed voluptatem iusto ut libero deserunt et sed odio maiores voluptatibus distinctio mollitia repellendus doloribus autem id officia nulla rem voluptate tempore est et quae odit nihil tempore natus unde architecto provident sint repellat ratione ut dolorem quia est ut voluptate aut esse quisquam et perspiciatis quidem non et.', '1', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('904', '1', 'Sunt molestiae fuga natus eveniet voluptas libero aut voluptas.', 'Veritatis natus voluptates explicabo sit quae rem laboriosam vel consectetur vero adipisci ex voluptas amet sit nam quia a est consequatur soluta deleniti voluptas laudantium dolores consequuntur dolores tempore amet dolor fugit dicta ex occaecati est perferendis perspiciatis repellat ipsam voluptatem numquam ut est voluptatem sint aut soluta aliquam quasi delectus non ducimus sit earum nulla rerum soluta dolores rerum dolor expedita et id modi minus id mollitia laboriosam qui dicta fugiat possimus beatae est iste enim voluptates sequi quas architecto minima magni labore enim nemo et ipsa dolorem nam consequatur corporis aut labore quis enim tempora dicta ipsum velit qui praesentium qui esse est ut et voluptas voluptatem labore fugit rerum culpa deserunt autem eligendi eum et deserunt iusto rerum perspiciatis vel est distinctio voluptate distinctio et error corporis quia animi est dolor quia atque sint aut fugit enim sunt quis soluta deserunt nam labore esse tempore qui et sit rerum accusantium voluptatem sapiente consequatur et et vitae tempore quo repudiandae qui perspiciatis natus quas non consequatur incidunt quo repellat ut incidunt facere ut itaque rem commodi hic reprehenderit saepe nulla aperiam rerum quo quo vero ut autem eum consequatur voluptatum nisi vel maxime tempore nesciunt recusandae perferendis ea natus ea alias veritatis eum similique vitae eius facere beatae qui maiores minus tenetur et delectus non et vitae nostrum quis placeat enim nihil rerum minima non voluptatibus ut saepe at esse sapiente asperiores ut natus possimus molestiae numquam nam esse aut delectus rerum labore enim cumque sint fuga natus ex natus quibusdam deleniti veniam dolor eos eaque harum quisquam aliquam autem mollitia ut nulla eos vitae sint vel voluptates facere enim voluptate similique maiores nesciunt aut recusandae voluptas et ut vero iusto et voluptatum aut aut porro optio vero esse modi rerum voluptatum consequatur et corrupti in rem voluptas nihil at optio sed voluptatum sint magni necessitatibus unde placeat provident vel tempora voluptates sed vitae ut aut vel fuga officia odio consequatur nam hic ut possimus velit placeat qui est nemo sunt consequuntur hic eaque voluptatem.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('905', '8', 'Cum voluptatibus ipsa minus iusto dolor.', 'In excepturi provident dolor necessitatibus ex placeat rem quasi eos magnam et officia distinctio temporibus voluptatem et eos nihil consequatur sint necessitatibus doloribus quo ut modi sunt neque natus sit voluptatum asperiores nostrum voluptates voluptatem officia temporibus suscipit voluptatem qui vel qui sint rerum sit est veritatis et quisquam nobis nihil eveniet velit accusantium nisi corporis tenetur rerum occaecati quo adipisci iste in dolores sapiente asperiores libero est reprehenderit doloremque sed nulla natus similique enim animi reprehenderit dicta quaerat ipsa rem est eveniet officiis et animi suscipit maiores fugiat omnis expedita nesciunt nam non placeat et voluptatum qui vel nemo consequuntur laudantium omnis aliquam dolor voluptas molestias rerum minima commodi aut eum est modi quisquam laborum eos ullam vitae corporis excepturi et nam aut enim est voluptas incidunt quam eos vel atque reiciendis tenetur illo deleniti qui perferendis eius dignissimos nostrum ipsa et maiores aut aliquam iusto sapiente quo autem rerum similique vero accusantium eligendi ut at ullam dolore amet nihil et quae dolorem illum vero et facilis blanditiis quo perspiciatis est unde in occaecati dolor in dolore molestias nihil voluptates aliquam sint et dolor quia vel ad officia fugit suscipit quos consequuntur est praesentium ab non dolor omnis voluptatem quo et est corrupti et ut voluptates id quasi blanditiis fuga eligendi voluptatem porro dicta eaque aut perferendis aut repellat quod qui vitae quasi eos et dolor sint facere consequatur hic sapiente aut nesciunt sint ut soluta dolore et velit modi et asperiores corporis provident voluptas omnis illo magni aut aut aspernatur aut consequatur et sunt dignissimos dignissimos quia nisi corporis ut maiores aliquid ad perspiciatis inventore consequatur dolores doloremque cupiditate eaque corrupti doloribus voluptate magnam rerum sint possimus voluptatibus error et asperiores voluptatibus hic nisi nostrum voluptatem ipsa magni voluptas nam et omnis error vel porro quisquam qui est temporibus aut deleniti eos cupiditate ut deserunt molestiae et amet et esse iste quo dolorem aliquam molestiae ab sed officiis laboriosam reprehenderit ipsa ipsum accusamus consequatur impedit nobis accusantium est repudiandae voluptatibus possimus porro fugit nostrum non porro accusamus facilis eaque sed ea et est tempore et est velit enim quo doloribus nihil eum unde veritatis magnam voluptatem esse culpa voluptates quaerat harum in aspernatur et magnam cumque sunt vero praesentium consequatur quo est ipsa cumque.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('906', '5', 'Omnis ut velit at.', 'Sequi qui maiores non nihil quae illum repellat ipsa quibusdam tenetur aut officia eos autem corporis magnam nesciunt perferendis inventore sit et eos quos quibusdam eos aperiam tempore ipsum assumenda iusto ratione et in repudiandae enim blanditiis cumque eum sit iusto a sequi et ut eos voluptatem a dolor delectus amet iusto natus nemo qui maxime ad voluptas aut labore rem eum doloremque aut voluptates et aut esse illum qui eius et sit vel ut ex delectus perferendis commodi ea libero et non ut non delectus et aperiam impedit est quibusdam voluptas nam sint repudiandae quia sit iste dolorum et rerum deserunt et molestias ea dolorum vel iure autem et reiciendis commodi non quidem explicabo aperiam eligendi quae voluptas ea illo hic minima expedita labore repudiandae vitae in ipsam sit quisquam beatae ratione pariatur delectus voluptatem molestiae quis deleniti esse ab velit velit similique consequatur et error autem enim sit totam ut omnis odio aliquam quisquam nemo ea et sunt dolores autem qui eveniet quis aut provident reiciendis ipsum aut illum sunt provident dolor aliquam repudiandae et est nisi cupiditate occaecati aliquid exercitationem ut eum omnis sed laudantium minus possimus eos placeat occaecati expedita ut velit perspiciatis pariatur veniam rem eaque sed et optio facilis necessitatibus odit consequuntur dignissimos ut quia ut quae placeat doloremque assumenda delectus molestias eum quam est magni quaerat tempora deleniti quasi est voluptates sed corrupti ut sit asperiores iste consectetur illo facere sint sint vitae quia voluptatem quis ducimus est enim nam rerum quia natus consequatur quia libero voluptatem molestiae labore quos error iure explicabo perferendis dolorem sit tenetur occaecati amet consequatur expedita vel hic et odio sunt provident doloribus alias tenetur hic eaque enim ullam est incidunt voluptatum sequi nihil recusandae explicabo aut sed atque aperiam adipisci quos commodi voluptas sit ut deleniti enim mollitia amet modi fugit incidunt aliquid in corporis molestias natus aut praesentium dolore quam esse expedita maiores dolor sint distinctio esse suscipit dolor facilis iste voluptatum quos debitis mollitia incidunt maxime incidunt molestiae esse omnis deleniti quia laboriosam nesciunt qui consequuntur rem odio natus voluptates ipsum laudantium minus velit quibusdam nihil corrupti maiores cumque soluta vero architecto ab commodi soluta odit excepturi id voluptatum sit aut quae cumque similique assumenda repellat minus voluptate illo sed est ea molestiae ut perferendis est velit corrupti aut voluptas inventore distinctio eum cum minus id accusantium fugiat molestiae architecto fuga sit.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('907', '7', 'Quod vel sit natus veritatis nemo.', 'Impedit qui sit perferendis dolore non quo corporis nihil voluptas facilis provident est qui magni dolorem ea sunt vero in vitae autem et quis rerum sunt ut et dolor dolorum temporibus porro quam quisquam accusantium nesciunt facere quae eveniet temporibus voluptas qui in asperiores dolores aut iure id doloremque omnis voluptas rerum voluptas neque voluptatem quod et velit sit architecto quo unde quasi velit expedita laborum saepe voluptate quod sit accusamus et in corrupti ex sed id dicta architecto odio et qui aut adipisci magni est deleniti ut eaque ipsam non amet ratione necessitatibus et unde eos temporibus debitis deleniti est corporis vitae consequatur et nihil voluptatum quasi et explicabo iusto doloribus dolores impedit incidunt unde consequatur quam eos voluptatem facilis eveniet ut voluptatem quo sit necessitatibus vel nobis qui consequatur harum dolorem totam rerum inventore cum et libero distinctio autem est soluta provident a explicabo praesentium eveniet aut praesentium nulla consequatur autem labore facere id in praesentium et in molestias doloremque hic beatae aut corrupti et autem rerum porro molestiae nostrum laudantium culpa ad dolorem illo fugiat mollitia nostrum laborum aut explicabo quis dolorum quis ducimus officiis exercitationem eligendi sequi omnis assumenda nisi fugit totam voluptas rerum animi distinctio vero nulla voluptatem voluptate et qui cupiditate omnis et nam explicabo sunt ducimus rerum deleniti repudiandae et at expedita voluptatem vero rerum et libero est delectus aut deleniti doloremque dolore consequuntur laborum tempora cupiditate velit vitae eum repellat labore aliquid cupiditate sint voluptates recusandae est aut rerum rem qui maiores amet quas voluptatem vitae incidunt voluptatum deserunt omnis sunt dolor tenetur et nam corrupti in assumenda earum non tempore in asperiores ea soluta dolore voluptate voluptates tenetur ipsam iusto excepturi illo tempore qui.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('908', '7', 'Sit dolorum architecto tenetur quia officia.', 'Velit id iste et dolor qui repellat minima velit dolores quo provident fuga sequi enim reprehenderit quod vel officiis praesentium magnam voluptas sunt consequatur ut sapiente expedita voluptatibus quia minus velit officia dolor natus tempore adipisci laboriosam accusamus sit ipsa tenetur dolores numquam dolores voluptas nostrum dolore sunt dolor cum sit dolorum tempore repellat architecto necessitatibus dolor eligendi aut voluptatem aut sint laborum qui blanditiis incidunt aspernatur alias reiciendis autem dolores rerum cupiditate iure architecto culpa libero inventore velit omnis consectetur sunt maxime vel et ea nihil aliquid similique perspiciatis iure veritatis enim temporibus officia sint earum totam commodi libero quam ipsa quam consequatur placeat quasi aut architecto ex nihil repellat quia nihil et eligendi est sed dolorum fuga est sed similique illum non illum non hic perspiciatis nisi exercitationem sequi voluptatem aut aut voluptas sunt sed qui reiciendis porro error ut quia officiis odit ducimus ex ipsam laborum at possimus est alias ut illo nulla incidunt odio quia quia ut aliquam dignissimos dolorem iste labore rem qui voluptas eaque repellendus nesciunt aperiam nihil voluptas error ut enim animi quos voluptatem mollitia esse in et molestias modi omnis dicta rerum repudiandae omnis et in quia modi nulla tempora perspiciatis ab ea modi sed et rem ad odit saepe minus rem sed excepturi ipsum animi dicta mollitia aut ut iste alias praesentium quia placeat dolore hic unde aut odio qui ipsam cum dolores iusto laudantium consequuntur illo nihil quos aut in ducimus eos qui sed voluptatem quibusdam optio dolore est eos molestiae quae fuga dolor nostrum consectetur magni assumenda sed incidunt eos velit asperiores itaque quo quia et iure minus veniam reiciendis possimus tempore et quasi earum praesentium ut ex possimus ut voluptatem distinctio et nisi nisi labore aperiam quia totam suscipit sed nostrum aliquam voluptas aut vel quos cupiditate quia iusto.', '0', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('909', '8', 'Laborum consequatur eaque et.', 'Neque cum hic harum ea animi itaque tempora totam dolorem sapiente nisi dolore ea adipisci voluptates facilis ut quia at ducimus officia mollitia dolor ducimus quam hic dolorum quod dignissimos quod est minima beatae consequuntur at quia id nisi ut consequatur molestiae corporis mollitia vel ipsa nemo ut nemo facere omnis quo maxime perferendis necessitatibus veniam et dolor dolor vero asperiores qui doloremque eos fugit libero reiciendis totam et enim numquam molestiae quasi animi itaque mollitia tempora voluptas eos quasi a voluptatem sit qui et nostrum et autem quod est dolor rerum vel minima atque similique est doloremque nihil maiores similique sint pariatur praesentium laboriosam sed placeat consequatur delectus omnis molestias eum quod sed quasi facere maiores quo mollitia adipisci ut natus ullam laboriosam sed occaecati similique amet fugiat unde et quo aspernatur eos molestiae ab vitae culpa minus velit et eum atque omnis numquam rerum esse vitae expedita dicta aut voluptates magni adipisci enim quis sed numquam dolor et qui sunt temporibus aperiam eos facilis perspiciatis repudiandae sint eos accusantium sit rerum eaque aut voluptas repudiandae et voluptate corrupti sed explicabo aliquid iste ut et deserunt sunt non dolores architecto pariatur dignissimos at suscipit sit accusamus dolorum ut recusandae sed quia veniam temporibus quo omnis iusto non aut rerum et ipsum soluta blanditiis ipsam eos aspernatur magnam nihil odit accusantium iusto qui consequatur culpa aliquid qui sequi sint tempora quia inventore adipisci expedita nesciunt voluptatibus eum unde sunt aut ea dolor minus consequatur commodi ratione exercitationem nihil aspernatur est cumque asperiores qui et rerum totam impedit sint soluta et autem voluptatibus nesciunt est aut mollitia maxime excepturi officiis est iure inventore sequi eaque recusandae aperiam dolore et voluptatem quis suscipit velit ex facilis earum in possimus aut deserunt quis vero vel nihil veniam deserunt aut odit ut.', '1', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('910', '5', 'Velit sequi nam voluptatibus hic suscipit et dolor.', 'Repudiandae et et optio est dicta fuga voluptates aspernatur officiis impedit nihil sequi sit in assumenda omnis sequi veritatis eum distinctio ut recusandae est autem vel fugit occaecati sit blanditiis ipsa consectetur vel quod a vitae suscipit officiis et debitis sapiente quis asperiores aut excepturi quam ea aut quia assumenda deserunt quia ut vel deleniti enim eum corrupti pariatur doloremque et et facere assumenda voluptatum eos in natus ea aspernatur rerum cum sit non ab officiis voluptatem dignissimos enim ut corrupti deserunt rerum ut aut error enim veritatis dolore atque architecto ut rerum non nam repellendus minus et et aliquam eos dolorem accusamus assumenda voluptatem voluptatibus recusandae et alias numquam eos quidem asperiores illum consequuntur praesentium consequatur culpa reprehenderit debitis error amet voluptatem sed dolores tempora a commodi voluptate voluptatem accusantium quidem voluptate minus dolorem qui et voluptatem iusto unde excepturi doloribus dolor quia cumque in quas ratione iusto quidem molestias aut ullam est necessitatibus et tempora provident tempora molestias molestias voluptates ea ipsa qui aliquam est dolorum ut consectetur blanditiis voluptatum esse iusto rerum ducimus non autem autem consequatur totam natus eveniet asperiores velit placeat voluptatibus quidem veritatis sed et velit vel quo dolore nemo sed aut explicabo laudantium qui et non quod accusantium blanditiis qui optio ab saepe delectus iste ut eaque enim dolorem iusto deleniti rem voluptatem dolorem et temporibus aut illum ut repellat in consectetur molestias aliquid quis qui recusandae repudiandae nihil dolor maxime consectetur autem dolor ut doloremque id doloribus ipsa magnam debitis ut aperiam nihil labore porro rerum est aut sint eum occaecati cumque alias autem aut doloremque quo adipisci delectus molestiae hic qui magnam sit tempore maxime quae eius exercitationem delectus consectetur provident repellendus distinctio labore nam voluptate blanditiis voluptatem explicabo nobis tenetur voluptatum quasi accusamus repellendus sed quae eum debitis maxime excepturi commodi dolor dolor minus et veritatis ut quidem voluptas vel quibusdam et cupiditate quos facere praesentium maiores eaque est quo porro libero nihil saepe consequatur beatae voluptas voluptatem asperiores laudantium placeat perspiciatis facilis error est rerum et molestias amet illum molestiae nostrum neque facilis placeat aut et dicta minus.', '1', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('911', '7', 'Ut cumque nobis dignissimos magni dolorum.', 'Non quo dolorem alias nostrum quo corrupti neque et adipisci recusandae sit alias incidunt debitis eius autem quia qui at aliquid nostrum in aut et iusto aut distinctio expedita aliquid laboriosam voluptatem occaecati aspernatur labore sapiente non aut dolorem quam non repellendus sit illum molestiae tempora unde voluptas odit occaecati in quibusdam deserunt fugit est earum qui corporis quo nostrum in tempora eius et similique eos cum ullam ut corrupti temporibus est et eveniet totam ad quasi ut iste molestiae officiis aut dignissimos voluptatibus ut esse dolorem molestiae dolorem omnis quia voluptatem vel sed iusto corporis optio quia eum saepe repellat nisi expedita accusamus ipsa dolores est ut nobis aut ducimus voluptas ullam hic temporibus non rem a voluptatibus autem temporibus optio in adipisci dolor quia in tempore sit tempora dolorum occaecati nemo quia quis amet dolor possimus non accusantium consequatur sunt non tenetur id consequatur omnis rerum minima illo sed adipisci delectus suscipit qui nulla voluptatibus ea voluptate quam fuga non occaecati facere voluptas molestias rerum accusamus id vel ut voluptas ut et sint cumque aspernatur veritatis expedita inventore vel suscipit atque eaque eum ab ratione consectetur et animi suscipit eveniet omnis laboriosam eum non ea et sunt voluptatem alias omnis qui ut quaerat voluptas exercitationem voluptas deleniti atque pariatur unde facere aut facere architecto sed in dolores enim eius voluptate aperiam ad repellat reprehenderit in quis ea reiciendis et voluptatem iusto possimus aut quos repudiandae debitis autem labore sint consequatur vero dolorem quae et impedit veritatis dignissimos id voluptatem sunt ipsam ut et laudantium eum incidunt velit deleniti autem nisi recusandae neque et sunt eum odio in ut sed sequi sit facilis voluptatem libero quo tempora et illo.', '1', '2017-05-02 22:59:38', '2017-05-02 22:59:38');
INSERT INTO `course_news` VALUES ('912', '10', 'Alias repellat quae illo voluptatem alias.', 'Inventore totam aut aspernatur dolores molestias nesciunt delectus voluptas aut qui nemo in qui cumque excepturi beatae deserunt aperiam praesentium ipsa itaque velit recusandae aperiam ut neque aut ea nam quasi voluptatibus ea assumenda deleniti alias laudantium et harum odit magni voluptas qui repellendus distinctio suscipit molestiae illum dolore aliquam natus omnis incidunt iure error et molestiae consequuntur labore iste delectus et sunt iure tempora provident assumenda sint sit quis culpa dolore tenetur dignissimos natus possimus est facere et consequatur autem voluptatem qui cum veniam commodi qui ratione nisi aut minima officiis animi dolorem tenetur laboriosam doloremque voluptatem aut consequatur corporis nihil illo voluptatem quia odit labore et non ipsa ullam dolores ab minus incidunt soluta id nesciunt modi inventore et rerum omnis itaque ratione maiores rerum quia consequatur voluptas minima aut minima expedita soluta aut pariatur aspernatur quia repellendus harum esse aut voluptate facere nihil assumenda nihil cumque nulla nihil placeat voluptatem non dolores aut natus eum ut fugiat placeat harum ipsa provident ut velit atque ullam possimus similique dignissimos molestiae quasi nostrum dolores aut aperiam qui eos quis et dolor aut nemo veniam blanditiis et ea doloremque et quia sequi sequi amet praesentium cum sit numquam dolorem eos nam ut quos ad nulla est et alias placeat sunt eveniet reiciendis consequuntur rerum eaque qui quos reprehenderit asperiores quo vero necessitatibus adipisci qui omnis laboriosam eaque doloribus autem modi quibusdam id at laborum quidem voluptates tenetur laboriosam quas iure voluptatem veritatis dolores inventore quis in laboriosam voluptate blanditiis similique.', '0', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('913', '4', 'Maiores iusto quas illum et soluta est ratione.', 'Aliquam id non consequatur soluta hic inventore cupiditate nemo nihil minus vel distinctio voluptas dolorem qui fugit tenetur doloribus sed est sit reiciendis non dolorem mollitia blanditiis maiores dicta dolorum alias doloribus est ab et accusantium rerum nisi veritatis aspernatur itaque soluta tenetur velit dolor minus eum est quisquam error amet id error nihil numquam dolor ea impedit eos cupiditate non sit quod repellendus commodi impedit nisi et ut nostrum accusantium sunt voluptas iure quos officia reprehenderit iusto sunt aspernatur velit quaerat unde aut qui nemo exercitationem quod aut reiciendis vitae debitis debitis mollitia recusandae commodi eum repudiandae dignissimos ea et recusandae cum perspiciatis provident a aut ipsam ipsum placeat quia eum accusantium provident delectus doloremque rerum voluptate necessitatibus eum quibusdam deserunt et itaque ut maiores voluptatibus vel veniam dolor harum consequatur temporibus sapiente sit saepe ratione ducimus qui et enim ut sit aut officia ipsa eos qui temporibus recusandae quae dolorem ab quas culpa qui illo ipsa perspiciatis libero repudiandae molestias sunt quisquam quas ut ut voluptas dolorum id quia molestiae cupiditate quos dolore perspiciatis voluptatum mollitia maiores saepe voluptatum dolores velit amet et nobis ipsum sint non harum blanditiis est doloribus est dolor minus laudantium consectetur ex et optio voluptatem qui consequuntur temporibus voluptas aut quia odio non cum molestias quaerat et ut quibusdam possimus voluptatem rem qui sapiente reprehenderit eaque sed maxime quos est molestias id accusantium consequuntur deleniti quia consequatur molestias nostrum velit eius quis adipisci et et saepe et quisquam dignissimos sit sunt rerum consequatur minima quia quaerat voluptates ut aut harum corporis sit doloremque ut doloremque consectetur doloribus atque dolore minima neque consequatur et sed molestiae est deleniti nobis accusantium rem ut unde non est cupiditate minima placeat nobis veritatis officiis eaque cupiditate impedit id alias ullam repudiandae incidunt voluptatibus fuga ad sint amet commodi illo aut iusto.', '0', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('914', '8', 'Laudantium tempora non dolore nisi eius voluptatum facere.', 'Quia occaecati et sunt aut quam nam a velit error suscipit sequi quo omnis et iusto dolor ducimus illum delectus architecto accusamus perspiciatis et asperiores repellat quas vel distinctio quia fugit ut non quaerat omnis dolor voluptatum rerum soluta fugit ut tempora eos vel et atque possimus voluptatum totam dolores qui tenetur fugiat sint sequi aut tempore nostrum odit repellendus non sit exercitationem quasi doloribus doloribus nobis omnis voluptas eos iste consequuntur dolor pariatur molestiae doloremque hic animi voluptatem ut et iste est et placeat quis omnis qui rerum est reprehenderit voluptas accusamus et aut fuga quae non hic non et voluptas temporibus iusto sit a dolores perferendis corporis a quia sequi quas dolor qui nulla itaque ducimus qui libero sed vitae consequatur in laudantium quibusdam est iusto tempore enim nostrum dolore quia dolorem aut quo possimus et accusamus sint ullam illo cum unde aperiam error vel voluptatibus quae optio natus id eum voluptatem itaque non quaerat accusamus praesentium accusamus deleniti illum voluptatem quos labore sed eum voluptatum deleniti at quibusdam optio itaque ut cumque nemo sint et nobis dignissimos modi corporis laudantium ea impedit consectetur quisquam ut ex iure voluptatum perspiciatis aliquid et distinctio iusto rem beatae enim quos aut aut autem occaecati nihil error doloremque ut quisquam possimus est voluptatem facilis praesentium nemo aliquam quos eos in quia enim molestiae earum rerum molestias consectetur deleniti voluptatem sapiente quis eius sequi repellendus ut repellat earum quos adipisci vero cumque expedita placeat voluptatum id et similique voluptatem nihil voluptatem ut beatae iure ea facere libero quas et officiis ut perferendis natus consequatur odio et magnam et blanditiis assumenda aut commodi placeat eos est necessitatibus quam dolores non in sed expedita quos ut omnis porro laboriosam maxime magnam maxime eligendi similique voluptatem eveniet laudantium vel consectetur et eius dolorum nostrum odio quis laborum iusto itaque ullam aut aut quis architecto reiciendis nihil autem qui voluptates in alias eaque distinctio labore veniam et accusantium esse fugiat natus ut quae illo.', '0', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('915', '10', 'Aliquid fugit omnis omnis labore et optio porro.', 'Ut rerum quod blanditiis et ex dolores molestias reiciendis et eos totam laboriosam amet suscipit earum quo dolores laudantium quos ducimus ad eos sapiente dicta recusandae est animi sequi placeat consequatur iusto animi deleniti et fugit optio deleniti dignissimos amet corporis praesentium numquam maiores quo amet ut voluptas odio vel eveniet et quis recusandae sed adipisci excepturi porro velit beatae voluptas impedit aut voluptatum quo quasi ex saepe voluptas corrupti voluptatum voluptatem dolorum in voluptatem voluptatibus eaque in voluptatem numquam nemo consequatur voluptatem maxime et praesentium voluptates quam fugiat ea sint sed et nam maxime suscipit voluptatem voluptatem pariatur a dicta consequatur aspernatur odio saepe quibusdam tempore nam quidem veniam perferendis impedit eaque facilis libero ipsam maiores enim laudantium dolorem recusandae blanditiis ullam incidunt deleniti molestias et ipsam voluptas dolor molestiae eius aut praesentium aut iusto laudantium quia et eum ea autem totam dolorem perspiciatis commodi fuga eaque omnis quis magnam aut voluptatem ut et commodi qui non culpa minus beatae excepturi occaecati maiores suscipit eveniet vel adipisci est ut voluptas dignissimos in molestiae est excepturi enim perspiciatis suscipit exercitationem iusto natus assumenda animi sapiente tempore repudiandae eius et quasi non nisi veniam eum asperiores corporis aut deserunt sint.', '1', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('916', '9', 'Eum qui ad repudiandae explicabo et molestiae sit veniam.', 'Eaque quidem dolor culpa quia voluptates nihil ipsam quia rem dolores sequi maiores a nesciunt ut nihil itaque recusandae nam molestias ut est voluptatem quam a modi sapiente similique officia deleniti tempore ut optio sed nesciunt non quis deleniti cumque voluptates et error qui necessitatibus nam quibusdam ad recusandae quia assumenda non modi sed in possimus sit saepe deserunt dolores eveniet explicabo voluptas saepe et deserunt in quos qui sit labore quasi et omnis voluptas consectetur magnam doloremque eos maiores maiores facilis ea voluptatem earum est sit recusandae quisquam est neque maiores molestiae et est harum impedit temporibus dicta et delectus rerum iure quo rem pariatur molestiae sint qui ut ipsa nam quod eveniet voluptatem sint fugit delectus facilis sit provident ab eligendi tempora itaque modi laborum minima praesentium vitae exercitationem eos consequatur suscipit ex porro aliquid in qui placeat necessitatibus dolor quasi cumque adipisci id ad sunt possimus sed qui quis illo enim eum repudiandae aspernatur consequuntur eveniet pariatur ab voluptatem ullam suscipit possimus non praesentium quam eos rerum dicta commodi qui qui sed suscipit corporis ex ducimus dolorum fuga minima aliquam praesentium rerum nam qui vitae possimus non ducimus cupiditate distinctio exercitationem dignissimos corrupti beatae quia voluptatem reprehenderit tenetur sapiente vel occaecati cum quia maxime qui qui nihil sed omnis consectetur illo et alias sed aliquam voluptatem velit sequi laudantium exercitationem sed porro laboriosam quae architecto tempora quos ratione adipisci cupiditate fugit harum doloribus et molestiae omnis voluptatem quis earum nisi labore optio doloremque qui et voluptatem voluptatum maxime rerum ipsam rem est maiores quisquam nobis labore illo voluptatem illo autem suscipit eum fugit ut voluptatibus tempora perspiciatis quia nostrum explicabo officia et veritatis quod quia quisquam consectetur provident voluptates occaecati tenetur accusamus quia et rerum enim distinctio est quo ex voluptatem molestiae iusto cumque aut cumque totam porro id qui sed dolores ratione totam aliquam aut amet vel quae laborum molestiae perspiciatis cumque nisi et nihil ut et officia laborum velit rerum est aspernatur deleniti unde aut facilis sint sunt rerum vel illum omnis velit nesciunt quibusdam ut voluptatem officiis itaque qui fugiat accusantium ut eveniet voluptas eaque aperiam beatae ex officia ad illo voluptatem et consequatur est qui nam id aut sit pariatur.', '0', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('917', '3', 'Dignissimos et qui sint qui quos quo.', 'Quaerat reiciendis fuga quisquam qui explicabo consequuntur non ut vel sit quia illum aspernatur quaerat sequi ratione non cupiditate quis est enim explicabo consequuntur et totam culpa optio et reiciendis non illum ducimus et sint sint laborum voluptatem quae deleniti veniam neque ipsa porro nihil aliquid rerum voluptas ex quasi sed esse est ex saepe facere repellat sit incidunt nihil explicabo qui reprehenderit atque rerum praesentium et magnam et laudantium recusandae voluptas nostrum sed ea deserunt amet fuga aliquam debitis et non iure voluptas sequi maxime dolorum et tempore et suscipit molestiae voluptatem amet possimus eligendi molestiae et molestiae ut officia cum aperiam aperiam et maiores laboriosam libero voluptatem cupiditate dolor ad voluptate voluptatem dignissimos earum ullam nobis delectus provident praesentium dolores facilis nostrum minus eaque necessitatibus placeat molestiae molestiae voluptatem molestiae ad eaque occaecati id fuga dicta officiis consequatur ipsa provident ex iusto iusto ut cupiditate autem explicabo iste sit ut rerum dolor est in aliquam ea magnam dignissimos eligendi sit mollitia quis minus vel magnam et magni explicabo ut ratione et cum in commodi recusandae et voluptate quo exercitationem sit eaque consequatur pariatur occaecati eaque harum sunt saepe id id qui assumenda quos dignissimos eligendi rerum aut nemo praesentium sapiente pariatur enim nostrum deleniti repellendus sit deserunt eos ut modi vel unde deserunt ut tenetur sit quia eos aut mollitia autem culpa quo cumque libero eius quisquam est dicta nulla quis aut consequatur molestiae veritatis dolor illo magni corporis beatae iure voluptatem et distinctio odit modi ea atque nobis et tempore ipsum sit sunt.', '0', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('918', '9', 'Et velit veritatis nulla nesciunt eos culpa.', 'Quia sint quas qui id et voluptas quidem iure commodi quis alias aut ad perferendis nobis corporis culpa consequuntur rerum quaerat provident nihil quas quasi voluptatem dolores repellat id necessitatibus ratione omnis qui dolorem odio dolor suscipit blanditiis ab eos excepturi et voluptas reiciendis quia sint aspernatur est quo minus eos molestiae voluptatibus id quia adipisci at laudantium quas et officia omnis corporis rerum adipisci sapiente iste pariatur sed tenetur labore autem soluta vel ipsam expedita molestiae vel blanditiis voluptatem eum iste perspiciatis nisi voluptate nihil voluptatum natus ea fugit sint voluptatem asperiores perferendis pariatur quia odit rerum cumque quas omnis libero sapiente molestias aut molestias quis dicta quibusdam velit porro sunt ut hic est quas aut doloremque voluptatem ipsa ut libero pariatur voluptatem voluptate totam fuga dolorem est excepturi sunt consequatur at incidunt amet a fugiat quo dolorum consequuntur laborum ut esse beatae minus ut accusantium suscipit distinctio consequuntur non laborum deleniti dolorem dolores reprehenderit voluptatem sequi maiores porro corrupti aut inventore perspiciatis suscipit voluptatem repellat quo beatae sapiente dolor occaecati id labore sint dicta neque voluptas ab corrupti magni voluptates voluptas explicabo illo quam laborum non non voluptas sit sit fugiat totam commodi aut possimus nihil magni et illum qui autem ut enim delectus laborum ut quidem ut qui labore enim aspernatur iusto aliquam nisi nemo molestiae cum provident impedit sint culpa expedita dolor recusandae consequatur ipsum incidunt qui voluptatem libero perspiciatis sint quidem distinctio praesentium molestias iste laboriosam id a quos recusandae illo ut soluta aperiam itaque aut expedita et aut illo maxime dolor fuga quo pariatur sit autem doloremque quia aliquam ut facere molestiae quisquam fuga qui sunt culpa consequatur qu