INSERT INTO `course_news` VALUES ('919', '5', 'Accusantium nobis culpa pariatur consectetur inventore saepe expedita.', 'Error autem qui nihil nihil quia ab necessitatibus sequi et voluptatum excepturi et velit quia ut accusantium qui amet dolor ipsa a odit tenetur error ut consequatur repellat porro molestiae aut similique et quidem nihil temporibus architecto doloribus alias autem et dolore minus repellat nihil ex aperiam veniam repellendus necessitatibus quis dolor neque fugit qui sunt maiores qui necessitatibus accusantium ex et facere ut qui omnis expedita iste eius temporibus doloremque praesentium cumque maxime ea veniam aperiam repellendus autem itaque maiores et odit voluptas est mollitia tempora sed quaerat est exercitationem accusamus doloribus beatae quisquam minima similique odit distinctio et aut quisquam eveniet natus quae deleniti quisquam iure sint molestiae aut nam ipsam aut quia facilis ut laborum numquam ipsa nobis illum et dignissimos esse quos delectus id eveniet necessitatibus quae qui molestiae at reiciendis qui vel illum iure est sunt laborum delectus excepturi quidem nobis et quasi non sed sit odio nihil et enim eaque maxime praesentium maiores maxime dolores sit voluptas quam ullam distinctio eos fugit qui eveniet assumenda nesciunt unde facere quia labore aut qui incidunt ut delectus velit est vitae omnis necessitatibus architecto quasi velit laborum autem harum modi velit quasi nulla provident facilis sunt voluptas dolores ipsam necessitatibus et ratione quidem et necessitatibus aperiam cumque beatae asperiores vel dolores est rerum minima delectus eius ut omnis a et dolores sed quas ipsum eius culpa magni maiores ipsa unde excepturi corrupti repellat ea ipsa aliquid quia veritatis aspernatur consequatur illo quis dolores placeat et ab cumque debitis ut autem molestias esse harum suscipit quia doloribus expedita distinctio voluptatem molestiae impedit nesciunt voluptas id consequuntur cumque minus modi minima eum vitae corporis molestiae