INSERT INTO `course_news` VALUES ('920', '4', 'Ducimus qui facere consequuntur ullam perspiciatis libero voluptatibus.', 'Minima sed quas aut in labore eos vitae ab amet nisi modi sit fugiat est numquam facere sed voluptas autem aut id iure sit eum ad quis natus ea corporis veniam ea qui non repellat perferendis veniam delectus qui temporibus eius alias maxime nostrum provident labore hic vero voluptas consequatur consequuntur esse ullam aspernatur voluptatum ex quidem sequi commodi atque error in corrupti voluptatem aut ut voluptatibus provident quae dignissimos eius expedita in beatae et reprehenderit nemo eius consequuntur voluptates et quia dolor sit corporis qui quos consectetur molestias ea dolor vel id tempore voluptas incidunt et libero ex voluptas enim voluptatem veniam saepe adipisci blanditiis eum nobis eos sunt ut explicabo totam quas blanditiis similique non voluptatem facilis ab alias et rerum laboriosam qui ducimus officiis sed aspernatur quia doloremque quisquam magnam eius debitis facere culpa illum quam rem sed delectus velit omnis ab est voluptatem enim explicabo exercitationem quos eos velit non incidunt provident autem occaecati quia voluptatem corrupti facilis placeat quia magni ipsum nostrum omnis id voluptatem dolorem velit ut eveniet labore cum totam sapiente quis itaque et consectetur et magnam consequuntur qui aperiam animi nemo sit deserunt aperiam optio sapiente a ut et quasi consequuntur omnis animi porro eum id qui quas in aliquid molestias corporis facere placeat facere dolorum delectus deleniti quisquam incidunt qui repudiandae natus ullam odit molestiae sunt mollitia sunt ipsum qui ut ut adipisci officiis odit numquam vitae dolore deleniti ea nisi tempore fugit consequuntur sunt asperiores voluptas provident vel voluptates voluptas quod ut reprehenderit vel enim dolores porro eveniet error ipsa quaerat vero eligendi enim reiciendis atque nesciunt qui velit ducimus nisi possimus quibusdam et cum similique ipsam minus dicta expedita libero quia nesciunt et cum qui omnis assumenda quas consequuntur aliquam et omnis nam odio fugiat et soluta commodi alias consequatur quis porro sint iste ducimus numquam eum repudiandae perspiciatis debitis eum ipsum.', '1', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('921', '6', 'Amet hic est vel pariatur natus ipsum.', 'Impedit et molestiae neque aut perferendis inventore commodi ut quam dignissimos laudantium magni incidunt voluptas ad illo sit sit adipisci dolorem est ipsa ipsum sit veritatis sit consequuntur dolorum doloribus officia vel beatae natus dicta ab suscipit laudantium est alias quia eos quis aut assumenda hic debitis facere magni quia et et qui non ipsum itaque rerum ratione necessitatibus fugiat in tempore possimus consectetur qui eius voluptatem perferendis pariatur modi aliquid debitis quos sapiente voluptas et quo porro explicabo ut et non ab odio aut eos id id velit nihil ducimus quidem architecto corrupti voluptas iusto ut molestias architecto molestiae doloribus similique nostrum voluptas error aspernatur omnis laborum cupiditate libero placeat minima debitis rem suscipit sed dignissimos asperiores sapiente unde et qui est blanditiis molestias quis quod consequatur praesentium perferendis ad omnis aliquid nihil occaecati debitis sequi accusamus necessitatibus voluptate laudantium quis modi laudantium reiciendis nihil cumque dolorem repellat ut incidunt nobis blanditiis reprehenderit atque doloribus libero ea rerum iste laudantium ut ipsa tempore necessitatibus reiciendis illo vero ut nulla est ab facilis omnis nihil aut commodi necessitatibus velit et voluptatem pariatur est neque et omnis reiciendis quasi dolorem in repellat illo est accusamus ipsum est error magnam error non mollitia enim sunt enim dignissimos omnis ut pariatur aut quia hic in voluptas quasi id qui beatae est sit qui culpa quod nihil deserunt neque amet omnis voluptas dolor asperiores cum sunt quisquam facere quia aut a consequatur consectetur vitae cum non ad officiis aut quidem magnam amet ut eos tempora unde recusandae et reprehenderit vitae voluptatem expedita perspiciatis atque dignissimos possimus aut aut nemo et accusantium corrupti iste tempore temporibus eum veniam qui fugiat atque a corporis adipisci est ea voluptate impedit nemo dolores quaerat et enim odio qui ratione molestias qui quasi quibusdam voluptas veritatis facere qui dolor nemo et aliquam saepe et et quia quasi accusantium nulla praesentium cupiditate nam est aliquid quam sit quo consequatur ea hic et praesentium et explicabo qui eius aperiam perferendis et ullam quis sit eius soluta voluptatem laudantium nihil eum non repudiandae dolorem a laborum molestiae in sit eum velit odio nisi sed aliquam explicabo dolor et recusandae quia ab ex nostrum reiciendis corrupti rem sapiente quidem voluptas consequatur harum maiores possimus accusantium alias optio voluptatem ducimus expedita praesentium quia ipsum beatae et maiores aut vel quos ea reprehenderit expedita consectetur quia corrupti corrupti officia sit reprehenderit ullam dolores vitae architecto saepe aut provident rem totam sunt sed ratione officiis iusto velit molestiae suscipit et iste.', '0', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
INSERT INTO `course_news` VALUES ('922', '4', 'Officia et quos iste voluptatem quis mollitia.', 'Repellat illo voluptatem non perspiciatis ut atque aperiam totam tempore ut temporibus voluptatem cupiditate ipsa sit aut ut voluptas deserunt dolores incidunt eos sapiente delectus qui veritatis esse necessitatibus est sit officiis voluptatem delectus natus vel praesentium ut molestias totam fuga impedit exercitationem neque sit doloribus ipsam blanditiis et veritatis eum molestiae cum quas sapiente exercitationem asperiores quisquam beatae consequuntur hic adipisci eaque nobis voluptatem quis adipisci aut enim nihil vitae nam officia nam officiis cupiditate velit doloremque porro aut doloremque voluptatem placeat quae amet ab voluptatibus soluta commodi sit veniam delectus officiis perspiciatis dignissimos quae culpa eveniet sit velit illum sed veritatis ad tempora quam earum nam voluptatem qui qui hic enim odit officiis molestiae porro aut vel eum alias animi sed dolorum mollitia minima voluptatem quia ratione sit et ex enim quia velit est maiores repellendus omnis adipisci dolores temporibus laudantium ad tenetur autem ipsa possimus eos nesciunt autem quos voluptas voluptatem velit odio eligendi ut corrupti itaque quasi rem harum qui necessitatibus ab dolores soluta odit soluta ab aut non sapiente quod sed similique molestiae repudiandae ipsa dolores sed repellendus quisquam quas non numquam quibusdam aspernatur nobis dolor voluptas eum placeat et autem voluptas veniam error explicabo nostrum culpa iure atque quia corrupti ut tempora eum ad eveniet laborum voluptatibus iure deserunt modi pariatur sunt cum laboriosam molestias eum vero debitis aut consequuntur error est eum ut quidem quia cum et natus ut nihil est accusantium id quia facilis consectetur ut aut ut qui suscipit architecto consequuntur incidunt modi vel pariatur itaque maiores et commodi deserunt totam nostrum esse ducimus qui ratione in illum inventore commodi fugiat delectus et fugiat expedita earum hi