INSERT INTO `course_news` VALUES ('923', '10', 'Laborum quibusdam et velit iste.', 'Facilis quo consequuntur accusamus iusto mollitia ipsa cupiditate maxime quos dolore cum occaecati repudiandae recusandae quos voluptatibus sunt ex dolorem quis dolor similique et alias quisquam tenetur modi laboriosam autem et deserunt neque quia sed quibusdam exercitationem et minima exercitationem cupiditate rerum vel qui voluptate beatae debitis aspernatur est et omnis praesentium exercitationem ab perferendis inventore et aut quisquam reprehenderit et nesciunt quod reiciendis beatae voluptatem et saepe exercitationem dolorum adipisci exercitationem aut unde dolores consequuntur sit et tempore repellat assumenda eum voluptas accusamus expedita aut voluptas aut et alias officia corrupti quibusdam sit ea debitis officia deserunt sunt voluptatibus est ducimus possimus libero perferendis officiis facilis possimus dolores ut inventore et ut quod aut dignissimos non ut molestiae eos quos id ipsa voluptas qui sit ut corrupti blanditiis enim exercitationem natus nulla iure possimus quas sequi esse voluptas et delectus optio eum tempora voluptatem vero id inventore placeat dicta sapiente voluptatum vel asperiores consequatur et ullam velit aliquam possimus ab alias officiis rerum et magnam odit soluta nihil aspernatur mollitia et nemo voluptates et laborum dolor minima rerum neque omnis quos quidem iure qui voluptatibus architecto corrupti eveniet vel animi rerum et quas voluptas praesentium ea enim officiis autem exercitationem eos voluptates iure sed temporibus unde fuga aut doloribus rerum labore mollitia a est maxime odit asperiores odit non ut et ut tempora ducimus mollitia est temporibus facilis.', '1', '2017-05-02 22:59:39', '2017-05-02 22:59:39');
