INSERT INTO `course_news` VALUES ('930', '6', 'Sint deleniti nam aliquid unde vero in sunt.', 'Error deleniti aspernatur voluptates fugiat sed nostrum corrupti aut ut quia sunt omnis facere sequi ab doloremque quos expedita dolore vel temporibus debitis accusamus et ut eveniet praesentium ut ut iste doloribus fugit nihil rerum consequatur libero alias doloremque beatae sed est cumque molestias rerum et consequuntur sit qui beatae laboriosam ipsam fugiat molestiae occaecati velit provident accusamus doloribus debitis ut velit occaecati veritatis laborum ipsa dolorum iusto ratione ut voluptatem aut voluptas voluptates molestias dolores quibusdam at omnis est et ratione quisquam in voluptatum voluptates ratione tenetur expedita iure quas maxime repellendus in eaque molestias culpa aut laborum et ut non ipsa laudantium sunt qui quod quis in illo veritatis veritatis rerum iste autem qui explicabo beatae placeat autem asperiores alias dolorum facere culpa sed qui quasi quam voluptates dignissimos aut ea perspiciatis omnis in natus provident earum sint voluptatem neque beatae sint placeat praesentium aut quos doloribus molestiae ut sit neque minus qui et maiores aperiam reiciendis sint vero omnis quo quo exercitationem dolor rerum ipsa vel veniam doloremque aut maxime magnam quasi occaecati enim numquam et voluptates et corporis sapiente doloribus est tenetur qui est omnis adipisci aliquam aliquid nisi voluptatem non quam sequi nisi nostrum sint vel rerum unde rerum repellendus consequatur qui voluptas ipsa saepe asperiores maiores ab et dignissimos similique aut et perspiciatis quidem esse saepe repellat eos nisi voluptatem esse iure odio velit at earum sed optio vero omnis ipsam quam natus eum beatae.', '0', '2017-05-02 22:59:40', '2017-05-02 22:59:40');
