INSERT INTO `course_news` VALUES ('935', '1', 'Ipsum qui alias iste sunt fuga soluta.', 'Autem itaque omnis accusamus eaque perspiciatis et et modi quaerat laborum et nihil in magnam ut quia laborum dolorum qui enim quos aut suscipit et et odio asperiores voluptas qui dolor eos placeat perspiciatis molestias facere quasi inventore labore aut id eveniet et voluptate a rerum voluptatem ab dignissimos qui quam ullam praesentium ea aut facere quo quo nemo ex in sequi distinctio dolorem dolorem aut incidunt et similique quis aut est deleniti excepturi odio et laboriosam et omnis nostrum odit nemo in autem accusamus eligendi repellendus et expedita totam officiis harum voluptate eum voluptatum saepe rerum facere ut deserunt provident omnis aperiam quibusdam aliquid officia dolorem veritatis cum voluptatem qui deserunt id occaecati aspernatur deleniti repellendus corrupti eius nisi numquam ea deserunt commodi quidem quod eum qui consectetur velit impedit ad quisquam minima eveniet vero quo incidunt mollitia dolor sunt esse magnam qui ipsum quisquam dolor perferendis ea iure maiores saepe enim qui magni voluptatum in eos possimus id et eaque alias sed ea et ut nostrum quia minus fuga voluptatum numquam voluptas eligendi deleniti iusto placeat qui dignissimos perspiciatis necessitatibus repellat quia cupiditate et aliquid sunt iusto nulla voluptate tenetur itaque quia iusto hic cupiditate illum veritatis at eum iure labore temporibus quo vero eaque suscipit illum in commodi occaecati eveniet occaecati rerum maxime et quam culpa qui est earum facere veritatis culpa aut magni voluptate in error laudantium et explicabo amet qui sequi nam nemo ipsa eligendi quidem voluptates recusandae molestias ut reprehenderit eos deleniti corrupti labore officia odio cupiditate quibusdam deleniti ipsam ratione sit quae veritatis ut in delectus dolor excepturi repellendus autem ut temporibus quidem maxime et aliquam id quis quia qui sit nemo aspernatur illo vero laboriosam et iusto doloremque 