INSERT INTO `course_news` VALUES ('936', '9', 'Accusantium est consequuntur est.', 'Rerum qui beatae blanditiis delectus et vel voluptatem quisquam et nesciunt aliquam nihil amet iusto dolores quaerat veniam tempora voluptate id est assumenda aspernatur illum quis cumque qui rerum iure placeat doloribus minima praesentium nihil voluptatem reprehenderit et quas repellendus quo consequatur voluptas vero exercitationem voluptatem doloremque vel consequatur dolorum nam tempora hic facere hic qui sed vero ut maiores dolore ea doloremque iusto aspernatur aut neque ea incidunt labore ut deserunt fugiat provident temporibus sunt et consectetur voluptates et temporibus tempora placeat et sed velit iste cum possimus minus quibusdam aut et error recusandae et saepe illum eum voluptas voluptas repellendus cum perferendis fuga non eum consequatur vel tempore error aut non dolorem et officiis aut nostrum asperiores et blanditiis et ipsa reprehenderit suscipit laboriosam accusamus quisquam cupiditate voluptas ab ut et quos iusto ut dolor maiores sunt nam unde nesciunt error molestias corrupti ea et et suscipit ut aperiam omnis et nostrum autem ipsa exercitationem dolores ea dolor deleniti ea fugit omnis et fuga minima dolorem quia neque est qui voluptatem quaerat optio consequatur in omnis ex natus quisquam animi laudantium non officiis adipisci neque et in enim similique iusto eum quia corrupti omnis id sit laudantium consequuntur molestiae odit eos quasi eius debitis repellendus officiis aut itaque doloremque tempora aut magni soluta quo laborum reiciendis hic rem quis id voluptatem quidem voluptatum nisi ea autem vel et in non voluptatum hic veniam et nihil atque dolor doloremque qui corrupti distinctio quam iure vitae exercitationem praesentium occaecati laudantium quisquam unde quasi omnis autem ullam ut officia rerum est nobis et id cum dolores est adipisci enim velit vero quod dignissimos molestiae enim labore nobis et aliquid ea eum molestiae voluptas et cumque porro id di