INSERT INTO `course_news` VALUES ('937', '4', 'Fugit sit adipisci nostrum ut et itaque.', 'Id qui impedit voluptatem quis cum fugiat vitae recusandae qui velit quo mollitia saepe voluptatem beatae non autem soluta deserunt asperiores enim iusto eius ut fugit amet nisi corrupti provident et id et corporis rerum qui aut velit in assumenda tenetur blanditiis optio nihil sint autem quaerat exercitationem distinctio nam beatae tenetur veritatis tempore et occaecati doloribus molestias libero mollitia numquam commodi aut temporibus sunt voluptas quia perferendis provident ea asperiores veniam excepturi sit autem est quia est in necessitatibus eaque eos aut quisquam voluptatum qui facere repellat mollitia non sint velit voluptatem tempore possimus eveniet vel at ea culpa nihil beatae voluptas et ut illum vitae et vitae qui omnis in sunt soluta qui occaecati facilis ab voluptatem eligendi rem fugit est incidunt ut vitae ut qui quasi qui accusamus corrupti maiores voluptas dolor qui eum odio cumque et esse eum doloremque sit recusandae molestiae nihil in hic velit vel cupiditate excepturi ad velit vel incidunt id fuga nemo ut et rerum dolores est laborum temporibus maiores laborum et non voluptatibus corrupti vel ratione sunt porro corporis minus et corporis et qui aperiam tenetur omnis ab molestias libero harum quia alias consequatur temporibus aut ipsam laboriosam repellendus non earum similique ut commodi non maiores voluptas voluptas omnis vel impedit incidunt labore cupiditate sunt quidem ullam alias velit a nobis eaque aut possimus ut perferendis qui nihil non quas expedita praesentium velit eaque maiores deserunt consectetur consequuntur voluptatibus aperiam dolorum et corrupti est laudantium magni ad et atque magni nostrum repellat voluptatum non illo molestiae cupiditate mollitia tempora in reiciendis perferendis laborum non ipsa deserunt doloremque accusantium aut molestias nostrum iure ad dolorem minima architecto aliquam voluptatibus et aut sapiente dolorem aperi