INSERT INTO `course_news` VALUES ('944', '6', 'Qui consequatur quos iure nihil.', 'Aspernatur aliquid pariatur omnis omnis non qui deserunt veniam iure dolorum eos dolores laboriosam et autem hic similique pariatur qui sit beatae ipsam officiis sequi aut nihil et accusantium aperiam aliquam minima sapiente alias deserunt repudiandae enim dolorem sit eaque rerum minus ad nobis autem aut ut odio quis sint doloribus suscipit aliquam vitae natus est aut cumque est id corrupti facere occaecati ex sunt aut assumenda voluptas sunt dolor accusantium exercitationem vel et qui voluptate distinctio doloribus harum minus repudiandae sit ut dolores enim maxime enim pariatur voluptatum ad et et sed quis consectetur id adipisci veritatis quo odit ratione nihil iusto eos nostrum dolore explicabo voluptatibus debitis qui omnis eligendi et ut eveniet minima totam ratione omnis excepturi reprehenderit non iusto officiis quis velit in non voluptates consectetur rem doloribus consectetur et ullam velit ducimus quia sint necessitatibus vel occaecati et dignissimos in ut magnam est nihil enim et similique et nulla quasi voluptatem consequatur modi rerum aperiam velit dolor non dolorem id est commodi consequatur mollitia reiciendis facilis hic eum officiis mollitia quisquam nam voluptatum fugiat natus velit et aut sequi rem delectus doloribus dolores nesciunt corrupti iusto facilis consequatur autem praesentium iure ut perferendis voluptas eaque ipsam natus ut at dolorem in voluptas velit quis nesciunt laboriosam quaerat corrupti deleniti tempora ex sequi deleniti eos alias libero dicta numquam reprehenderit quaerat nesciunt natus perferendis sed et eum enim quos soluta corrupti quaerat dolorum quia est aliquid aliquid ea eos odio dignissimos minus aut inventore quae et nihil et quos placeat quas ex qui facilis unde dolor et aut beatae saepe atque saepe est impedit recusandae provident cum quasi odit molestiae esse blanditiis ipsum placeat ipsam blanditiis corporis non sapiente ad nam a mo