INSERT INTO `course_news` VALUES ('945', '3', 'Illo non quia est.', 'Minima pariatur neque hic nulla voluptas officia laudantium velit ullam animi sit assumenda perspiciatis aut fugit sint eveniet suscipit similique tempore consequatur culpa voluptas est ipsam et facilis fugiat qui omnis quasi rem tempora unde at aspernatur aut aut maxime ad asperiores nemo neque consequuntur nisi omnis facilis est possimus quod esse provident odit sunt cumque eligendi odit explicabo sint qui deserunt illo aut fugiat rem consequuntur nisi illum quas ut aut fugit minima cum non eum expedita voluptatem et laudantium explicabo debitis earum perferendis ducimus eum ea ut aut consequatur porro omnis nemo quidem accusamus sit earum omnis corrupti beatae facere animi eaque in officiis veritatis aliquam modi et rerum pariatur non temporibus sint minima asperiores delectus enim et ipsa officia officia doloribus dicta illo aut ipsam dolor praesentium blanditiis incidunt dolor voluptas tempora ut labore fugit nobis qui ullam debitis doloribus tenetur ratione hic reiciendis unde nihil magnam rerum at dolores ratione deleniti ipsum sunt non aspernatur illo ex dolore sed aut quia architecto minima ipsum distinctio id eum ut repellat iste quas et laudantium saepe consequatur aut mollitia aperiam laudantium odio laboriosam consequatur ipsa omnis alias beatae rerum est laboriosam eaque consequatur et sint alias deleniti amet consequatur iusto eos nemo nesciunt nam saepe neque tempora harum voluptatem vel voluptatem laborum voluptatem nemo voluptate culpa aliquam id molestiae neque dolorem rerum voluptatem commodi eum consequatur omnis laudantium occaecati nulla harum amet reprehenderit quam aut dolorem error rerum labore dolor ducimus perspiciatis perferendis est illo et esse quia voluptatem nesciunt repellendus consectetur aspernatur doloribus est omnis sapiente quam quos officia qui velit eligendi vel sed minima voluptatem sint nihil voluptatibus magni aut voluptate quis et qui quis et rem enim laboriosam magni est aperiam non vitae blanditiis facere mollitia rerum velit doloremque eum ducimus repellendus et rerum modi dolore exercitationem dolore id occaecati omnis consequuntur molestiae omnis fugiat consequatur sunt labore sit nisi veniam quam voluptatibus rerum architecto nostrum sint nam et tenetur tenetur dignissimos eum velit facere aut in architecto nulla quod atque eos molestias similique qui libero eum dolorem aut consequatur hic ut esse magni occaecati mollitia similique aut ab sapiente nemo fugit accusamus sit minus non quasi cupiditate quia.', '0', '2017-05-02 22:59:40', '2017-05-02 22:59:40');
INSERT INTO `course_news` VALUES ('946', '4', 'Possimus quasi voluptas et optio.', 'Exercitationem earum aut ipsa rerum similique facilis libero sapiente laboriosam eaque officiis eum aliquam sunt quia velit voluptas est quae quidem voluptas unde vero minima sint sit repellendus aut quia totam porro officia ea quod rerum est voluptas aliquam nemo non ea nihil optio similique ea aut voluptatem perspiciatis quidem ut libero quidem totam ad vel placeat mollitia repellendus recusandae qui commodi voluptates sint qui repellendus exercitationem error necessitatibus repellendus excepturi nam nihil commodi corporis maxime harum id minus sit recusandae ut facere fuga aperiam culpa voluptate dolorum sunt voluptas id eaque incidunt corrupti itaque quasi commodi sapiente necessitatibus unde quia quas eum aut et aut id voluptas expedita nihil recusandae et quas temporibus eos nesciunt error ea expedita quia debitis quasi exercitationem minima quia iusto ut maiores rerum et harum omnis veniam cumque repudiandae iste consequatur minima harum aut quidem quo qui deleniti autem assumenda autem repudiandae possimus impedit porro aperiam vitae consequuntur sint est dolor aut nemo sapiente quod ab facere iusto cupiditate sed minima nemo deserunt quod est doloremque debitis nulla numquam provident voluptatem porro similique qui commodi omnis ut dignissimos nesciunt odit architecto voluptatem facilis earum non est rerum eaque reiciendis at aspernatur illo aut explicabo odio rem sunt perferendis totam dignissimos non doloremque harum non dolorum natus tempore necessitatibus necessitatibus et repudiandae eos quos laudantium labore et omnis dolore recusandae temporibus voluptate a rerum sint dolor illo nihil dolores porro dolorem velit similique id fugiat aut amet quae et repudiandae rerum quia corrupti officiis consectetur optio sit doloribus corporis debitis impedit sint blanditiis nesciunt dolorum et laboriosam illum itaque voluptas aut rem soluta.', '1', '2017-05-02 22:59:40', '2017-05-0