INSERT INTO `course_news` VALUES ('947', '5', 'Eum id hic illo reiciendis nihil quas hic consequatur.', 'Maxime nulla iste totam at maxime odit sunt quod et ducimus non eius ut dicta nostrum non iste sint cum veniam modi eum ducimus repellendus similique facere eos nesciunt est esse quasi reprehenderit assumenda nobis rem quia vel consequuntur commodi consequatur soluta vel vitae adipisci quia sapiente rem eligendi saepe architecto alias maiores tempora consequatur minus quod eum omnis nostrum quis ut rerum voluptatem ex consequatur error quis assumenda sit quia atque fugit et dolorem porro aspernatur ut aut aspernatur numquam quia neque ut cumque et tempore assumenda ipsam harum porro cum eos quas libero harum veniam eius laborum provident quo voluptas est qui animi sapiente sit a dolorem quo labore nemo consequatur laboriosam deleniti sunt repudiandae mollitia unde et qui et accusamus corporis eos quam nostrum et tempora rerum nihil eius maiores id sed sit sint totam qui occaecati temporibus adipisci numquam eligendi sint sunt nostrum nobis facilis totam exercitationem dolores culpa quis voluptatem soluta quis quisquam quia error et expedita quia accusamus ex quo et necessitatibus aut doloremque sed nostrum exercitationem magni quia quaerat ullam assumenda odit ea ea ut ut inventore laboriosam nulla sit soluta quo consequatur in provident qui quisquam sit sit sit esse ipsa exercitationem quo architecto tempora et dolorem atque dolores ullam et nostrum odio ut quasi neque voluptatem facere doloribus beatae maxime sunt et voluptatem atque molestiae ex velit nostrum ut eligendi molestias adipisci magnam beatae voluptatibus ut eligendi laboriosam et laudantium ut explicabo neque omnis id reiciendis ea ipsa ducimus ex in porro possimus et culpa quia sit ex architecto maiores sunt et aut temporibus labore qui delectus eaque occaecati sint est asperiores et ipsum corrupti officia qui sed quae adipisci vero quo corrupti et iusto corrupti magni voluptates eos delectus aper