INSERT INTO `course_news` VALUES ('948', '9', 'In consequatur ut recusandae quam vitae.', 'Tempore temporibus possimus qui illum dolorem dolorem quaerat accusantium rerum harum soluta sunt sequi inventore et ipsa quidem autem non sunt est rerum ut dolorem dolorem culpa odio commodi minus sunt non quia doloribus exercitationem consequatur minus delectus mollitia nobis illo nulla hic vel eaque ut quia qui dignissimos non facilis sapiente beatae consequatur cumque corporis modi aliquid architecto sequi perferendis et ratione voluptatem qui iure accusamus quod consequuntur deserunt recusandae laudantium est unde temporibus maxime dolorem placeat minus sit soluta ut cupiditate odit voluptatem ratione quia harum quas cumque molestiae dolorem labore aut eos eos commodi iste hic omnis autem rerum delectus voluptate quidem minima et sed in est quae iure ullam et ut maiores ut laborum natus sunt sed consequatur soluta adipisci adipisci tempore iure dicta asperiores omnis dolorem distinctio omnis eos dolores eum et eaque occaecati inventore expedita amet sapiente consequatur atque odio non omnis quisquam suscipit aut nihil inventore suscipit consectetur vel provident blanditiis velit dignissimos necessitatibus reiciendis amet ullam unde animi ut ipsum hic sit id culpa consequatur et repudiandae reprehenderit ab cum dolor maxime eos modi sequi ut eum excepturi amet adipisci in nesciunt nisi mollitia beatae in ut nesciunt iure et dolore atque cumque dolor quia officia cumque maiores quo inventore doloremque dolor maxime enim ea tenetur neque aut nihil quia voluptas doloremque hic iste ut similique non in.', '1', '2017-05-02 22:59:40', '2017-05-02 22:59:40');
INSERT INTO `course_news` VALUES ('949', '10', 'Voluptates alias ipsum iste deleniti at.', 'Ipsam consequuntur id harum animi animi ut cum veniam et omnis accusantium nihil molestiae quia beatae ut alias aut quod ut eligendi doloribus facilis ut et repellendus necessitatibus error porro at explicabo ut quia eos est sed a consequatur aliquam repellat non dignissimos cumque voluptatem alias consequatur qui eius sequi perferendis quia aut et reprehenderit minus aut dolorem et id delectus temporibus possimus ea porro eius similique minus pariatur explicabo esse qui et sint mollitia in illo dolores sunt facilis dolorem voluptas veritatis quae ut libero assumenda officia placeat praesentium praesentium rerum sint rerum qui adipisci fuga eum dolores tempore assumenda dolore facere harum consequatur voluptatem est suscipit delectus ipsam voluptatem omnis error est vel assumenda repellat quia omnis enim ullam magnam nostrum dolores earum at aliquam quod aut beatae tenetur esse soluta natus eveniet rerum est et nemo suscipit omnis aliquid porro aut nulla omnis magni dolores placeat minus deleniti nihil provident autem maiores blanditiis et perferendis natus enim mollitia architecto doloribus aut ab inventore debitis aut omnis qui et aut omnis animi ut quis aliquid totam in cumque voluptatem a sed sint animi assumenda consectetur in magni maiores iusto maiores eius et et voluptatem nesciunt ipsum hic dignissimos eos sint magni aliquam distinctio rerum corporis facilis aut enim qui tempore fugiat inventore officiis vero corrupti ullam eos cum fugit quae ut aut vel dolores quaerat sit veniam ut et nisi ipsam culpa et ab adipisci voluptate rerum et laudantium dolorem vel animi libero nisi nisi vero totam alias quidem distinctio cupiditate ipsam beatae incidunt qui hic unde sapiente fugiat dolore expedita maxime consectetur recusandae soluta unde qui quia ipsum provident dolor et accusamus quasi et illo magnam repellendus reprehenderit veritatis vel nemo expedita odio qui eaque ra