INSERT INTO `course_news` VALUES ('950', '3', 'Nemo voluptatem aperiam id nesciunt.', 'Ab similique voluptatem nesciunt maiores sunt ducimus sit quasi omnis nisi quod quos omnis facere perspiciatis quis aliquid dolorem molestiae qui vel suscipit accusantium at sed et molestiae natus dolorum voluptatem ut impedit magnam fugiat et aut voluptas voluptatibus earum dolorum ullam consequuntur alias dolores totam rem tenetur voluptatibus earum possimus incidunt dicta odit voluptates in ipsam sed quis repudiandae ut architecto ea est dolorum ab inventore non quisquam accusamus molestiae aut non et quae voluptatem id ut temporibus ex unde porro molestias ut quia iure quisquam vel nihil iure sed a officiis in dolorem eius perspiciatis fugiat dolorem omnis iure corrupti in et rerum commodi iure cumque odit veritatis omnis dignissimos ad aut voluptatem deleniti rerum nihil aut blanditiis eligendi voluptas mollitia at sed culpa quia nihil deleniti qui dolores aut fuga aspernatur esse aliquam voluptatum dolorem provident possimus aut fuga illum autem sapiente vel autem cumque amet itaque quas alias maiores qui eligendi autem minus est culpa ipsum autem provident at ab maxime quia sed maiores dolores ullam voluptas debitis reiciendis aliquam et illum at ipsum aperiam sit quia omnis cupiditate possimus amet qui aut laudantium aspernatur et tempore consequatur doloremque ratione veritatis tempora eum eveniet minima deserunt quo quae amet perferendis assumenda inventore repudiandae dignissimos.', '0', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('951', '8', 'Eum atque et quia qui labore sapiente.', 'Veritatis error voluptates sapiente quia accusantium vel dolor iste in similique velit nulla quas eos doloremque laborum quia cupiditate ea nam corrupti et culpa est ut sed quia dolores non ex at qui vel dolorem non dolores adipisci atque hic eius amet et voluptas culpa nihil sit voluptate laudantium quis laudantium sed exercitationem inventore dolore culpa et cumque molestias excepturi quia ea consequatur non fuga rerum est voluptate ut nam adipisci veritatis maxime corrupti natus voluptatem dolorum provident libero mollitia in sunt ut eveniet sit quia et sit sit facilis praesentium earum et atque nihil asperiores ut voluptate ea culpa perferendis numquam omnis blanditiis nostrum maxime amet ut quod quis vel maxime dolores a libero ex omnis expedita ea id dolores adipisci nulla minima officia natus qui accusamus ea sint impedit possimus cum illum cupiditate libero accusamus ea deleniti occaecati iusto non odit eveniet ut hic culpa aut rerum culpa velit officia voluptates soluta sit iste ea eligendi eum minus necessitatibus sunt quo nostrum repellendus itaque incidunt molestiae eligendi eum atque pariatur nam saepe consequatur sequi non aut a ut officia veritatis delectus suscipit facere similique nemo voluptatibus atque odio dolore non a neque illum magni ea repudiandae cum quia vel autem soluta fuga eum sint exercitationem totam vel rerum voluptatem aperiam unde aliquam optio et culpa magni qui ipsam officia ut nesciunt aut quos numquam ipsa eum ab error perspiciatis quos pariatur architecto inventore quis et itaque mollitia voluptas temporibus aperiam sequi qui rerum et omnis minima eligendi hic quo voluptas exercitationem occaecati ad mollitia ipsam commodi optio et alias reprehenderit dolorem reiciendis blanditiis incidunt qui dolorum molestiae possimus autem voluptas ea esse non accusantium quo delectus eum provident consectetur fuga consequatur harum eum accusamus qui expedita sunt eaque distinctio veniam officiis odit adipisci saepe est odio ipsam blanditiis facere rerum dolorum qui necessitatibus aut qui delectus laborum ut molestiae maiores distinctio quidem vel at dolorem consequatur laborum.', '0', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('952', '1', 'In vitae qui omnis repellendus id sit doloribus.', 'Aut tenetur voluptatem et velit ipsa pariatur et labore et vel enim vitae et alias corporis officiis facilis exercitationem est a quasi earum voluptate eum ea qui porro labore nisi laborum quas labore eaque natus nemo nulla qui est omnis fugit eum aut voluptas fugiat placeat commodi qui voluptas exercitationem ut culpa a cum quod tenetur hic et maxime fuga praesentium esse a impedit voluptas deleniti voluptatem aut et error praesentium numquam quaerat perferendis iste aut reiciendis sit minima quia ad tempore facilis sunt nulla qui aut quis deleniti nam similique quo non alias voluptas recusandae dolor praesentium ipsum sed eum aut nulla facilis eius iure et et dolorem quas accusamus vel vero voluptatum omnis numquam quas quisquam et possimus nostrum fugit vero molestiae ea itaque accusamus perspiciatis quos molestias adipisci aut esse quis quia quos quia voluptatem inventore quis aut itaque possimus assumenda possimus id blanditiis sunt et in doloribus est quos voluptate non eaque dolore non error accusamus voluptatem inventore rerum et ad et reprehenderit occaecati enim eligendi aliquid libero eum quis in exercitationem inventore accusantium ea blanditiis voluptas neque repellat autem cumque doloribus sed iste nihil quia dolores qui fugiat voluptatem atque nesciunt eos cumque debitis reprehenderit ad aut dolores suscipit inventore ut hic et velit ea corporis minus architecto quisquam qui modi eveniet fuga accusantium voluptates iste maxime fugiat illo voluptate nihil impedit quo odit quis laboriosam tempora.', '0', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('953', '9', 'Aut aut qui eaque qui hic.', 'Facere rerum eum deserunt deserunt itaque ab maiores unde mollitia facere eius est quos labore animi in numquam ad provident nulla non nam est aliquam quaerat ratione quaerat ut et odio saepe animi dolore doloremque mollitia blanditiis eligendi enim eveniet laborum ducimus eos ratione voluptatibus libero aut odio similique dolores ut voluptas qui quo tempora ex unde quia adipisci velit similique repudiandae mollitia error voluptatibus itaque praesentium repellendus ut magni eum soluta asperiores earum autem aspernatur voluptatem ipsa et qui beatae molestias accusantium quae voluptate et nemo consectetur vero et ut blanditiis sunt necessitatibus eius vel repellat omnis qui qui explicabo accusamus itaque nulla modi dolore tempora illo quaerat accusamus nulla quis dolorem veniam voluptatem eaque sed aut voluptas quos non sed dolor ut similique reiciendis delectus qui est tempore repellendus magnam quia est at aspernatur deserunt beatae reprehenderit et id ut saepe ad a temporibus ipsum ad voluptates nesciunt dolores sit rerum animi et asperiores amet quo officia ipsam facere aut labore voluptatum doloribus hic natus magni rerum at sed deleniti molestiae nihil occaecati velit consequatur illo qui nihil illo ut doloribus quam et earum autem repellendus itaque eum tempore excepturi accusamus quos quam est aut eos rerum est voluptatem saepe autem eaque dolore consequuntur quisquam aut expedita doloribus reprehenderit eaque beatae autem animi maxime sunt vitae dolores sed aut qui hic amet illo consequatur minus qui quibusdam non porro soluta et placeat saepe ex et nulla dolor nam qui suscipit doloribus facilis possimus commodi aliquam soluta explicabo nesciunt necessitatibus ab sed error qui aut quia suscipit velit commodi eius explicabo minima alias qui soluta aliquam aut iste et quisquam voluptatum molestias exercitationem ad error ducimus omnis cum modi quis animi doloremque adipisci iste veniam