INSERT INTO `course_news` VALUES ('954', '4', 'Possimus aliquid autem nam voluptatibus facilis alias blanditiis.', 'Corrupti corrupti accusamus animi et vitae ipsam iure tempora sed rerum ea a ipsum dolores ab temporibus rerum voluptas doloribus repudiandae eos eligendi laborum quis eum corporis eius est deserunt est repellendus ut ea ipsa quasi impedit et suscipit sint aut quos commodi quia et consequatur omnis quae ut veniam iusto dolor velit veritatis eum quisquam consequuntur quia architecto ut voluptatem consectetur dolorum beatae in reprehenderit quaerat minima aperiam doloremque tempore consequuntur accusamus ut est veniam iusto asperiores vel ratione cumque sunt ullam iusto tempore magni animi vitae nulla explicabo vel aliquid placeat nihil voluptas ea beatae blanditiis dicta quo id quia voluptatem placeat quasi consequatur id voluptatibus quae consequuntur et qui dolorem quia cumque velit ullam deleniti vero natus sunt repudiandae qui dolorem veritatis et non voluptas omnis assumenda est illo expedita aut facere aut iure et autem qui exercitationem blanditiis harum eos esse quam ipsum et et quisquam porro laudantium modi in et et autem debitis nihil non enim autem mollitia nam cupiditate unde ullam ut dignissimos esse aut qui quia harum velit et non in laboriosam et minus sed dolor tempora nulla et laudantium commodi rem explicabo praesentium asperiores exercitationem necessitatibus ea placeat cupiditate est reprehenderit dolores eum fugit atque quos sed minus harum autem nesciunt autem incidunt nihil quia officiis ut id fugiat laboriosam commodi iusto libero sit facilis est optio tenetur officia placeat aut et molestiae iste omnis dignissimos voluptas necessitatibus distinctio non in aut culpa consectetur deserunt numquam voluptas autem quisquam maiores exercitationem nulla sunt ab architecto saepe explicabo labore quas earum magnam dolor ab explicabo est perferendis labore sed beatae voluptatibus eaque repellendus ut consequatur iure et voluptate magni doloribus qui commodi molestiae.', '1', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('955', '7', 'Dolorem rem blanditiis eius odio non nostrum.', 'Maxime labore consectetur impedit aliquid facere repudiandae ad porro non sed facilis magnam sit libero voluptatem consequuntur dolorum assumenda in consequatur quis consequatur quis ipsum excepturi vel magnam nam neque molestiae quia excepturi voluptatibus hic consequatur tenetur voluptatem quam sed sit iure nam a facere autem perferendis beatae dolores ut enim rerum dolores neque perspiciatis corporis ut ut animi deleniti et quasi sapiente et repellat est ut ratione nulla qui distinctio accusamus et quidem officia voluptatum beatae voluptatem deleniti dolorem tempora aperiam inventore ullam hic atque nobis dolore tempora tenetur quas debitis magnam eos cum et labore sint sed rerum voluptas fugiat exercitationem adipisci quis sed in repellendus voluptatem ut at cupiditate itaque totam aliquid eum dolores aspernatur voluptas ratione nihil hic totam sint tenetur nihil provident modi consequatur enim sed nihil qui aut aut molestiae et veritatis quia earum amet et ipsum voluptatibus omnis repudiandae non eligendi et aperiam aspernatur omnis nihil eum omnis nobis autem commodi sunt placeat excepturi explicabo soluta voluptatum laboriosam cupiditate iusto excepturi nemo exercitationem adipisci nemo eos doloribus et magni accusamus nobis maiores fugiat inventore non molestiae beatae et nisi non eum aut officia enim quia a itaque quam sunt et totam aperiam est et accusantium eos est quo sed voluptatem ea et recusandae quaerat dolores tenetur accusantium expedita ut quibusdam et explicabo in voluptas et enim quasi corporis et et et eos saepe tempore nisi et et qui ut sit fuga quia odio aut tempore consequatur sunt omnis eos accusamus quisquam dignissimos reprehenderit et nihil cum non porro dolores ut optio magni repellendus dolorem perferendis esse minus recusandae quia illo iusto pariatur in porro cumque nam qui at nulla fugiat omnis reprehenderit omnis eum doloremque ex consequatur illo architecto harum officiis voluptatem ea minima dicta architecto expedita et earum ducimus exercitationem repudiandae non sequi ut dicta cupiditate voluptas totam ea aliquam ea et quo dolores vitae adipisci aut nostrum eaque aspernatur id nisi ex aut corrupti qui inventore architecto corporis excepturi voluptatem nam autem quia deleniti pariatur reprehenderit ut laudantium tenetur quasi natus et eum quidem possimus enim recusandae voluptatibus libero aliquam rerum ad dolor ea dolores assumenda quod voluptatem praesentium molestias aut tempore cum ut facere delectus ut architecto ut a voluptatem perferendis officia aut qui error ipsa dolore molestiae quod a ipsam similique non facilis dolorem.', '1', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('956', '1', 'Aliquid incidunt totam quod facere labore quam.', 'Odio omnis autem est animi laboriosam corporis voluptas ipsa ea minima expedita qui voluptas at ab asperiores modi et ut odio soluta aut provident laudantium et et est eaque asperiores incidunt eius voluptas id optio consequatur suscipit provident sequi maxime distinctio quia fugiat voluptatibus voluptas qui ratione deserunt atque odio doloremque qui molestiae minus maiores vel ut hic similique ut qui dolorum aliquam aliquid quo eveniet perspiciatis est atque quam ut delectus quaerat soluta vel sint incidunt ducimus omnis eius deleniti dolorum explicabo exercitationem aspernatur facere illum dolor beatae sed culpa id tempora fugiat ut recusandae porro minus possimus aut numquam sed voluptatum aspernatur natus inventore ex ut sint ipsam natus iusto qui rerum natus ducimus iste reprehenderit a ipsum consequuntur voluptatibus maxime tempora reiciendis dicta at non ea exercitationem enim nisi aliquam impedit itaque aut similique earum nemo natus aut sit vitae est soluta voluptate harum ut fuga mollitia eos dolorum consequatur voluptatibus at expedita non dolorem iure ut maxime voluptatem natus aut quos consequatur ex quaerat voluptatem magnam cum ut ullam ab quia dicta sit cumque quis quod et ab enim id provident fugiat blanditiis voluptatem labore et recusandae eum alias quidem autem nostrum omnis qui quod molestiae quia quia dignissimos ut enim aperiam maiores quam in exercitationem aliquam cum est iste quod quae quo quo dolorem et in eum consequatur provident et et a qui porro ut reprehenderit autem enim quas quia ut voluptas sed ea reiciendis excepturi autem dicta aut qui sunt mollitia molestiae architecto molestias dolore ipsum debitis eaque tenetur laborum amet laborum qui qui corrupti consequatur inventore optio quasi dolorem ullam at esse sunt unde accusantium ullam quis facilis culpa voluptatem exercitationem dolorem sed veritatis incidunt sed laboriosam atque aut 