INSERT INTO `course_news` VALUES ('957', '7', 'Aut aliquam laborum minima et aut dolores impedit.', 'Eum atque ipsa illum occaecati architecto nisi fugiat sed blanditiis nostrum porro et sunt nihil doloremque sed iste tempore ipsam quam modi dolor voluptatum sed ut sunt nihil nesciunt accusamus dignissimos impedit pariatur sit temporibus voluptas quidem exercitationem eum praesentium voluptatibus eaque ea consequatur est possimus repellat voluptate deserunt necessitatibus voluptate nobis voluptatem quis id delectus sint aut nam voluptas maxime et et non architecto fuga fugiat itaque a quia ea eos asperiores porro aspernatur recusandae est qui voluptatem dolorem voluptatem ratione unde maiores distinctio molestiae quis quisquam numquam nihil atque voluptate qui ut sit possimus omnis odit sed laboriosam qui minima excepturi totam excepturi iure officiis facilis et qui enim rerum et ab eligendi qui libero aut fugit dolore velit quas sunt ut voluptatem ut illo minus molestiae repellat ratione doloribus quam cum consequatur non qui aliquid et totam ipsa ut libero autem sunt quae dolorem sunt culpa ea reprehenderit deleniti necessitatibus voluptatibus modi magni reiciendis aliquid nihil molestias velit veniam reprehenderit nisi aut distinctio asperiores illo quas velit optio et et asperiores deserunt maxime harum nisi fuga nostrum rerum enim voluptates nihil.', '0', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('958', '1', 'Id laboriosam rerum voluptatibus rem aut officiis voluptatem sequi.', 'Cupiditate at et ad repudiandae possimus saepe necessitatibus architecto voluptatem qui at ut ex nemo quia qui ipsum repellat recusandae fugiat sit modi at laborum dolor debitis placeat sint alias cum fugit rerum ab repellat dicta ratione et minima eaque voluptatem harum necessitatibus esse officia velit rerum et optio soluta natus consectetur molestias rerum minima doloribus in illum et et aut et cum vitae vel possimus sunt impedit et nesciunt eos quia debitis ut enim ea qui aliquam iste quam necessitatibus deserunt eum soluta illo voluptas enim deserunt minus id aut atque est mollitia dolorem fugiat aliquam totam consectetur sunt rem dolore enim blanditiis fugiat in velit possimus dolores sed provident dolorem accusantium totam aperiam commodi rerum molestiae rerum ab vel doloremque aut temporibus non nulla dolorem qui hic a perferendis sunt hic dolorem deserunt numquam et aut consequatur mollitia sunt dolor eum at commodi in debitis ipsum eaque omnis nemo commodi est optio molestias inventore consequatur illo esse modi porro culpa quasi aperiam nihil aspernatur veniam natus fugit modi placeat minima aliquam iure laboriosam reprehenderit nesciunt tempora nesciunt laboriosam laborum non sunt expedita ut reprehenderit ut perferendis ullam quisquam veritatis aut quos est ut animi sunt nobis provident reiciendis ut qui nam dolorem quo debitis in nam soluta numquam omnis illum sunt eius odit repudiandae qui molestiae sint quam dignissimos totam facere dolor quod dolores minus ea nobis eum magnam porro qui doloribus quis non dolores error et aspernatur quibusdam sed et voluptas et et quidem est in ut et consequuntur velit veritatis in sit quam vero eos aut et cum omnis at magni consequuntur ut explicabo quia nihil rerum quae non repellendus sed qui at qui eum sit itaque iure quis magnam error itaque aliquam alias doloribus nulla est nihil error voluptas ea est earum non autem aliquam adipisci esse fuga praesentium asperiores aut optio distinctio et illo dolores omnis neque expedita dolor sed aut fuga rem dolore deleniti voluptatem architecto architecto doloremque voluptate aliquam veniam illum aut saepe dolores voluptatem et sint aperiam cumque provident eum sunt magnam rerum laborum aperiam voluptas tempore quia quo qui.', '0', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('959', '1', 'Hic placeat odio provident rerum ut autem non et.', 'Ipsa est consequatur voluptate eveniet quis est voluptatem aut in et alias ab recusandae numquam delectus ad tenetur enim rem illo nihil a architecto voluptates laboriosam necessitatibus voluptatem hic iste ratione nihil praesentium qui ipsa quidem voluptas sit numquam dolore rem voluptatem est tenetur suscipit velit laudantium sunt a doloribus in quasi dignissimos molestias dolor non impedit quibusdam et ea officiis ullam voluptatem quod repellendus consequatur saepe quia quae quos magnam tempora facere sapiente praesentium voluptate voluptatibus facere a modi fugit iste aliquam consequatur optio velit distinctio consequuntur harum aperiam at sed aliquam dolores tenetur ea numquam molestiae dolorum laboriosam praesentium et dicta similique quam ab rerum rem rerum ducimus nemo optio ut repellat optio vitae quia quia laborum eos facilis qui recusandae quod voluptatibus et doloremque provident doloribus sit recusandae qui est nisi iusto ea voluptate accusantium assumenda et repellendus porro dicta nisi ipsa velit et aliquid temporibus ut tempora eos voluptas dignissimos voluptatem tempore harum omnis maiores ullam delectus sint quasi officiis amet delectus voluptates natus sed quidem illum eligendi reprehenderit modi error nihil dicta ut illum tempora et est corporis voluptas rerum in recusandae repudiandae sit expedita autem eos doloremque qui quae atque quia temporibus vel animi natus praesentium consequuntur sed nam officiis iusto esse fugiat quis id dignissimos vero dolor voluptatum dignissimos qui corporis impedit a laborum id eveniet inventore et omnis doloribus assumenda provident voluptatum laudantium id ipsa quia est porro aut aut libero est omnis fugiat aut sed natus sed perspiciatis qui earum modi expedita qui quisquam dolorem qui voluptatum autem aut rem explicabo non corporis aut aut aut est quisquam quos eos temporibus est sunt harum eius dolor error cum r