INSERT INTO `course_news` VALUES ('960', '4', 'Illo odio voluptate quia odit.', 'Amet ab molestias repellendus dicta temporibus quidem officiis voluptatem et nulla odio qui incidunt cumque omnis aut rem sed quaerat rerum sed iure sit dolores incidunt occaecati inventore assumenda est accusantium ratione occaecati perspiciatis vero quae error impedit numquam cupiditate voluptatum error quis numquam natus tempora deleniti sapiente veritatis a officiis consectetur et ut fugit magnam minima praesentium excepturi quos quos quasi iste omnis aut modi nihil architecto hic quas earum a culpa nemo eos praesentium quia saepe fuga eaque aliquam perferendis ut quod ut aspernatur sed omnis perferendis eaque earum ut ipsam alias vel optio placeat sit qui perferendis nihil et quidem rerum non odit magni dignissimos et aliquid natus minus voluptatem et fuga iusto eos cumque expedita inventore nisi quam voluptas similique quasi sint vero a occaecati non laudantium minus beatae est consequuntur nostrum dignissimos dicta eaque soluta quibusdam voluptatibus eligendi in praesentium voluptatem et ducimus iste voluptatum a in dolorem ut inventore fuga perferendis nihil totam sunt et necessitatibus totam sapiente ab voluptas iste pariatur omnis eligendi aut ut ipsam et et esse eum eum omnis doloremque aspernatur quo libero beatae totam cum in est ullam harum sed unde sed est consequatur rerum est perspiciatis nihil et nisi quis quia labore praesentium odio dolor tenetur quae labore ullam est labore facilis iure occaecati ipsum praesentium delectus et expedita assumenda natus nihil et sed itaque nihil velit ducimus temporibus aperiam dolores maxime ut deserunt recusandae minima impedit a explicabo non autem delectus provident explicabo et ipsa quae perspiciatis id quibusdam molestias fugiat est eius dolorem vitae eum architecto numquam aut quis rerum corporis tenetur ipsum omnis qui quis aliquam et unde porro voluptatem esse beatae ex reprehenderit suscipit labore sunt at vel enim facere et 