INSERT INTO `course_news` VALUES ('961', '10', 'Aut dicta maiores ipsum porro harum.', 'Et incidunt totam pariatur aliquid impedit quos quis nihil quo consequuntur qui nostrum quasi accusantium consequatur dolorum repudiandae odio et asperiores aspernatur laboriosam optio accusamus molestias facere rerum explicabo aspernatur ad nobis officia eius nulla voluptate quaerat alias sapiente rerum iste quo ut vel et asperiores illo expedita nihil deleniti sequi ducimus explicabo qui dolores aut hic dolore blanditiis natus consequatur vero ab qui libero voluptas nobis totam omnis sint id voluptate saepe ut autem odit sunt eius architecto voluptatem velit numquam beatae sint quis iure distinctio repellendus animi dolore dignissimos mollitia et itaque repellendus in quos modi et quis numquam fugiat omnis ex provident officiis architecto incidunt non amet eos corporis et aut est repellendus non perspiciatis saepe facilis voluptas sed laborum qui dignissimos voluptas optio aliquam laudantium quam at non accusantium aut qui maiores expedita repellendus repudiandae optio rerum quia esse ut ut quia quidem veniam amet veniam quas quo ipsam voluptas occaecati rerum nulla quod omnis aspernatur nemo ea illo iusto maiores quisquam sed est architecto aut ut assumenda enim magni saepe quod rerum dolores voluptates veniam perspiciatis reiciendis non modi sit illum perferendis possimus iusto et qui sit consectetur exercitationem voluptas veniam animi reiciendis est reprehenderit provident et laborum dolorem quis quam voluptatem iste officia possimus debitis molestias sit quae ut ipsa nobis in sint laudantium repellat nihil ducimus consequatur in voluptatum voluptas aut earum iure corporis id amet sit minus ab voluptatibus repudiandae eaque asperiores libero dolor vero culpa id impedit sint vitae laboriosam sint expedita maiores quibusdam doloremque quia non sint soluta quam alias quia eius numquam rem nesciunt modi et at officiis beatae sint accusantium ratione qui aut tempora commodi cumque est sunt dolores doloribus voluptatem perferendis laudantium aperiam repellendus ex sapiente ea vel eligendi eos aut qui esse vel harum aut ad tempora accusamus dolorem eius assumenda at nulla debitis quo molestiae id necessitatibus praesentium sunt excepturi eligendi molestiae corrupti delectus aliquam porro velit aut dolorem ducimus nihil culpa sunt omnis sint repellat pariatur modi consequatur cumque ipsum vel dolorum rerum impedit.', '0', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('962', '7', 'Quaerat mollitia ut est facilis aut tenetur.', 'Quo officia maxime autem harum iste tempora in voluptatem reprehenderit odio ut voluptates beatae et dolorem numquam velit quasi iure consequatur voluptatibus voluptatem quis repellendus eos nulla quaerat nam officiis rerum id praesentium mollitia labore consequatur facere consectetur sit sunt modi sit eveniet nihil numquam consequatur ducimus tempora aut sunt voluptatem delectus natus itaque rerum sit error rerum et sunt consequatur sed iure optio consectetur rem quos reprehenderit dicta aliquam incidunt vitae est libero consequuntur commodi ut quod debitis voluptatibus cumque harum iste repellendus explicabo et et id quia beatae recusandae rem alias cum facere iusto illo occaecati quam at non animi ducimus porro consequatur tempore provident voluptatem qui incidunt earum vero iste rerum officia amet esse vero eum cumque delectus ipsam dolorem rerum quo nam voluptatibus eligendi illo dolorem fuga voluptas non recusandae suscipit vel quis consequatur quo enim qui rerum occaecati voluptatem voluptas quas consequuntur minus dolores dignissimos rerum veritatis ea nobis quidem in debitis ipsam molestias animi totam eius sint natus asperiores et saepe voluptatibus eos repellendus blanditiis quia et provident nulla veritatis est repudiandae et voluptas incidunt sed dolorem et ipsa nisi perspiciatis aliquid et sint illum quia odit iure ex quasi quam sit a quas voluptas temporibus quis fugiat distinctio molestias quo dolorem quibusdam perferendis ut numquam illo dolore praesentium ad voluptates quibusdam est dolorem error laboriosam aut molestias eius autem sapiente fugit iste in rerum et eos nobis sed in est voluptatum facilis assumenda officiis non sit quia veritatis adipisci quam officiis inventore quam repellendus qui et quasi delectus sed rem et eligendi consectetur laborum sapiente repudiandae quae adipisci totam excepturi nam facere et facere dolorum sapiente quo inventore eum maiores aut recusandae fuga quidem non id consequatur corrupti ut voluptatem veniam esse voluptatum eos aspernatur architecto ut occaecati tempore eum dolorum nisi omnis voluptatibus doloribus suscipit sed ut molestias reiciendis minima explicabo quod impedit voluptatem occaecati tempore quo voluptatem possimus officiis doloremque quia iusto praesentium ad non ipsum consequatur reiciendis aut eos sint consequuntur nam iusto quisquam numquam provident aut et aut quia ducimus quis nihil facilis consequatur molestiae nisi et temporibus veniam explicabo modi nulla qui et illum ab aut temporibus sed iusto nisi similique nihil architecto adipisci vel voluptatum ullam assumenda assumenda dicta omnis unde velit iure omnis ut ut nobis in in laboriosam consequatur dolor.', '1', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('963', '7', 'Odio eos officiis quo.', 'Voluptas et eos asperiores dolorem minima explicabo totam veniam non sit omnis in temporibus nobis odio ad et ut et rerum et iure omnis modi ut minus corrupti optio labore ad et est eligendi dolorem quae facere eligendi exercitationem sequi id dolores minus veritatis debitis aspernatur odio debitis voluptatem facilis eos vel quaerat mollitia et mollitia ipsa dolor veniam in et iusto asperiores deleniti labore aut quisquam explicabo ullam id iusto ad veritatis ut eum nostrum nulla eos et ipsa rerum quia eligendi minima amet vero eligendi unde mollitia sequi quam velit a quis non blanditiis ducimus libero commodi eos in hic blanditiis sed quaerat illo vero et alias placeat quia ut neque fugiat repudiandae vel expedita voluptate expedita omnis est odit dolore praesentium neque repellendus atque ab praesentium non neque voluptatem magni commodi sunt animi magni odio voluptas rerum et ipsa sapiente totam voluptatem soluta iusto repellat qui eligendi laborum totam eligendi distinctio dolorem harum voluptatem aut exercitationem ea recusandae suscipit tempore quidem cum ipsa eum et ut suscipit aut velit animi dolor molestiae ratione et nihil labore laudantium sed delectus nisi quaerat error possimus in eligendi ad sunt deserunt voluptates ex quia iste est quam fugiat magnam.', '1', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('964', '8', 'Beatae ea non laboriosam esse.', 'Rem quo eius quam corporis reiciendis quis unde id mollitia ipsa dolor vel cupiditate et blanditiis aliquid et numquam dolorem enim rerum aliquid aspernatur quaerat laudantium exercitationem iusto unde sunt enim eveniet a et quasi tempore vel aut quisquam quos est assumenda veritatis ullam rem suscipit voluptatibus ducimus porro ut quidem reiciendis sunt voluptatem qui enim aspernatur aut ea voluptate nihil aut vero quod sit ullam et beatae ea tempore ab aliquid provident doloribus tempore fugiat sequi vel velit id quam pariatur dolorem eum maxime veniam placeat placeat est sint labore dolore ut sit qui dolor libero iusto sit veritatis eum eveniet voluptatem occaecati qui voluptates non velit autem unde ipsum commodi reprehenderit sunt sit quibusdam quas laborum nulla aut iusto aut dolorum sit at eligendi perferendis labore nihil animi inventore earum eaque blanditiis quia corrupti debitis quae quae hic iure consequatur mollitia vel odit ut suscipit culpa a perspiciatis placeat voluptas ab laboriosam corrupti ducimus velit placeat dolorum eius doloribus aut dolor dolorum dignissimos ex quod incidunt accusantium accusamus nihil modi id vel rerum voluptatem impedit reprehenderit sapiente voluptatibus reiciendis et cumque consequatur repellat rerum et beatae sunt deserunt.', '1', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('965', '8', 'Repellat repellat possimus voluptates temporibus laborum.', 'Et exercitationem suscipit dicta facilis nesciunt asperiores odio voluptatem officia sunt rerum tempore eligendi excepturi quia omnis in ea quas libero reiciendis quibusdam quae alias velit ducimus expedita aut quo magnam maxime ut id voluptatibus doloribus commodi odit quae ut ut velit quibusdam dolore non perferendis blanditiis est vel et similique eum non in provident et nulla aut animi doloribus qui enim voluptatem eos voluptas molestias est voluptas suscipit eaque ut dolorem similique tempore eius hic eveniet quia ex nulla sed at suscipit quos vero omnis et dolor et commodi consequatur sunt quidem iure voluptas sunt quasi explicabo vel unde tempore qui officiis dolor sit minus nisi nulla incidunt rerum voluptas voluptatum fuga molestiae corporis enim aut necessitatibus delectus voluptatem et ullam quidem dolores inventore dolorem quis similique debitis vero molestiae est eos vel odio repellat qui aspernatur molestias ab quasi vero cum repudiandae quaerat exercitationem nisi doloribus fugiat alias explicabo ab enim ea et consequatur culpa dolorem alias eveniet est nemo tempora ex dolores voluptas voluptatem laudantium et ex voluptate et minima ex et suscipit ut aut fugiat tempore cumque eaque dolore cupiditate est velit ut et rem sed vel quisquam sed eius est dolorum ratione quia porro modi aut facere possimus odio eius aperiam quisquam consequatur porro esse et incidunt quis excepturi dolores sed qui molestiae minima est nostrum rem repellat optio aperiam tempora ipsam sed est ut sapiente asperiores rerum consequuntur eligendi nulla velit maiores natus ullam ut aut dignissimos perferendis architecto nihil quos sequi sit culpa id amet at repellendus animi voluptatem inventore impedit qui illum iure natus porro sint molestias aut repellat ex neque animi nostrum maxime esse officia laborum aliquam enim.', '1', '2017-05-02 22:59:41', '2017-05-02 22:59:41');
INSERT INTO `course_news` VALUES ('966', '7', 'Ut nisi velit voluptatem voluptatem ex esse non.', 'Molestias ut sed nobis quia cum in minima dicta suscipit nostrum mollitia facilis aspernatur voluptas consectetur qui accusamus repellendus et qui at voluptas sint voluptates repellat ut nesciunt numquam incidunt cupiditate quo quibusdam non quo fuga deserunt porro quis corporis porro aut impedit eum distinctio et maxime cum alias officiis nesciunt totam recusandae deserunt pariatur error voluptatem voluptatum ea explicabo molestiae atque quasi illo id et voluptatum repellat adipisci ab ea voluptas non magnam rerum labore nesciunt consectetur quam unde vel voluptatem non placeat in maxime esse nesciunt et suscipit rem delectus qui impedit voluptatem ea ut temporibus sunt omnis rerum cumque provident qui exercitationem velit fugit ut omnis suscipit et tempora reprehenderit magnam sunt sunt sit officia animi nesciunt vel laboriosam repudiandae praesentium et facere voluptates rerum ea enim excepturi sit nostrum suscipit consectetur dolore quis ratione repellendus omnis ad quo distinctio et sit quaerat necessitatibus ut perspiciatis qui officia totam distinctio sed voluptatum ut et voluptatem dolores facilis sunt magnam accusantium autem dolorem aut deleniti qui pariatur excepturi voluptas fugit voluptate assumenda laborum qui saepe nisi aliquid sunt quis deserunt molestiae quam aut dolor autem fuga quidem officiis tenetur dolor ratione sed quae doloremque quia est consequatur veritatis dolorem id cum modi culpa et architecto earum sint tempora officiis praesentium tenetur deleniti modi aspernatur neque nulla dolorem voluptatem minima atque aliquam rerum unde quam et et alias ea aspernatur modi sapiente qui sapiente culpa aliquid nihil aliquam quia velit non omnis perferendis id eum sit debitis consequuntur nulla velit quo libero nisi ipsa architecto sed soluta sit voluptate repellat sed sunt iure quo sit et pariatur cum facere quasi id omnis dolore perspiciatis pariatur architecto nesciunt qui iusto perspiciatis maiores reiciendis vitae autem doloremque illum laudantium sapiente expedita suscipit fugit animi quia sed aliquam nesciunt reprehenderit maxime esse ullam facere officiis dolorem et fugit dignissimos molestiae assumenda velit.', '1', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('967', '10', 'Totam doloremque molestiae voluptas dolor sit magnam aspernatur omnis.', 'Cum vel tenetur officiis est facere minus provident vero quis consequatur quisquam dolor delectus minima adipisci voluptas debitis aut officiis in quis voluptate ut facilis non culpa corporis omnis tempore aut facilis qui quo ea minima non atque dicta ipsum qui iure culpa sint et at cupiditate molestiae aut ut a cum quod expedita qui et aliquid at laudantium corrupti et alias inventore quidem pariatur voluptatem doloribus ipsam accusamus dolores ratione quo nemo suscipit eius nemo dolorem esse eum at tempore eius atque accusantium sit quis modi totam repellat qui corporis velit possimus molestiae ipsum inventore saepe beatae itaque quaerat alias et rerum distinctio quia autem dolor voluptatem quae sed vel iusto quos aliquid voluptate dolor aperiam veniam odit excepturi cupiditate provident beatae molestias labore veniam et consectetur maiores et sed eveniet iste cupiditate sed consequatur delectus quisquam deserunt earum aut totam ut qui rerum ea asperiores tempore reiciendis consequatur praesentium neque quia et veniam ut quos veritatis possimus odio qui et perspiciatis non quia delectus minima explicabo animi dolorem recusandae deleniti numquam cupiditate dicta eveniet sit numquam debitis qui ab doloribus nostrum molestias facilis non voluptates molestias neque quam est placeat aut voluptatem similique culpa maiores fugit ut possimus qui odit voluptas deleniti est et enim odio vero fugit a sit quam voluptatem deserunt atque qui et aut odio ut impedit enim id eius minima rerum et nihil beatae quibusdam veniam pariatur quae officia est et omnis exercitationem quidem reiciendis dolorem sint consequuntur sit quo optio velit sed qui fugit eos repudiandae ut qui dicta labore et et maxime cum consequatur placeat deserunt totam et beatae temporibus sit repellendus tempore quibusdam officia aliquid fugiat eos libero impedit a quia ut cumque delectus repellat quo nisi est aut ratione animi beatae et et modi rem quis harum in autem commodi et ex deserunt dolorum laboriosam excepturi minima sed sapiente aliquam voluptatem est doloribus id et ipsum minima non totam molestias at aut amet aliquid porro ipsum odio ut qui harum ex sit magni quo quam quo voluptate eius quae consequatur et dolores labore molestiae autem aliquam dolore omnis autem velit delectus id eligendi enim quia at autem neque nobis quas reiciendis ut consequatur ipsam voluptatum in eaque deserunt eaque sint ea reiciendis error doloribus ea sequi quo temporibus animi corporis est molestiae et qui voluptatibus et blanditiis aspernatur soluta praesentium totam est eaque illo vel sapiente molestiae nihil aliquam dolor quam facilis magnam sit quia aut odio iste earum aut quisquam nemo veniam sed quia.', '1', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('968', '2', 'Culpa inventore autem minus totam mollitia.', 'Quidem et doloremque quo aut quam et architecto odit aperiam ipsa est ut explicabo et mollitia molestias quasi autem similique praesentium aut sed in delectus placeat eaque modi dolore dolor est nisi et aut illum voluptatibus explicabo ab nobis aut eius non et perspiciatis sapiente sint consequatur eius illum quaerat omnis veritatis est consectetur quo aut quia vel aperiam eaque dolores neque blanditiis quis et rerum assumenda doloribus doloribus ipsa voluptatibus molestiae quidem dolores aut repudiandae nesciunt beatae culpa nihil nihil est et soluta laborum et adipisci possimus repellendus quod aut vero sed sint ut qui molestiae voluptatibus architecto et libero tempora sequi ea itaque laboriosam quis nam nihil placeat temporibus sapiente minima rerum nihil facere dolorum dolores est quo sed omnis quidem harum rem rerum rerum ad at rem temporibus odit et ut ad fugiat hic ullam sint est laboriosam voluptatem voluptatem vitae a quis aliquid voluptatem sed illum vitae beatae ipsa et dolor molestiae magnam illum neque quasi amet maxime sint non error eum soluta facilis ut et iure reprehenderit mollitia fuga libero minima enim recusandae numquam est id ipsa consequuntur fugiat eum maiores quia ducimus ut error neque architecto quis qui deserunt assumenda veritatis repellendus non dolores magnam impedit assumenda ut ex aut voluptatem ex sed veritatis beatae optio ea nostrum omnis provident id et sit et vel officiis qui eum omnis et quas quidem molestiae enim et at eligendi molestiae occaecati harum velit architecto temporibus dolorem aut cupiditate est labore quisquam minima esse placeat veniam unde similique hic aliquam distinctio rem quis aut qui voluptatem natus eaque suscipit optio eos quia quae aut asperiores velit ut est vel dolore labore voluptate et dignissimos et at error quidem aspernatur vel rem illo fugit nobis sapiente molestias rerum eum doloribus et iusto sapiente minima id fugit impedit consectetur velit optio quo hic est qui et tempore aut sed eum quo aliquid sunt et ducimus ipsum aut placeat cupiditate cumque enim sunt ad ullam facere repudiandae totam optio sit accusantium vitae est aliquam dolores exercitationem suscipit culpa facere sint perspiciatis explicabo voluptas dolorum vero eum eos dicta voluptatem nihil ut nihil quisquam quos enim quod excepturi possimus consequatur omnis mollitia ex possimus facilis ut autem velit commodi dolores unde ea sit architecto error et beatae eveniet quidem quis illum velit voluptatem deleniti sint laboriosam enim facilis et omnis quaerat quaerat qui quaerat culpa voluptas repellendus ipsum autem ratione nihil.', '1', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('969', '7', 'Non corrupti omnis nisi quia dolor aut blanditiis quia.', 'Aut quos suscipit ut voluptatem aut aut dolorum ut suscipit consequatur labore iure animi quia animi omnis voluptatem beatae ab amet pariatur ut itaque rerum unde voluptates odio repudiandae vel reiciendis cupiditate deleniti voluptatem hic nisi dolor maxime excepturi unde nobis soluta cupiditate quaerat natus quae dolor rerum quod voluptatem nemo laboriosam qui placeat eaque magni quia et aut et repellendus natus provident nam modi amet nihil aut culpa tenetur porro dolorum ex maiores et maxime rem iusto ullam dolorem eum cupiditate voluptatem est laboriosam nihil ipsa fuga optio architecto eligendi debitis nostrum voluptatem aspernatur cumque voluptatem aut nostrum eveniet aut quis ea vitae asperiores sed cum id architecto sed qui enim assumenda occaecati quod nam enim neque ipsum aliquid cum distinctio totam est earum dolor tempora provident consectetur et dolorem qui voluptatem ullam voluptates eaque cumque facilis quasi perferendis soluta temporibus iure tempora quia ipsum omnis vel fuga alias veritatis blanditiis unde et non omnis aut placeat et minima similique magni accusantium reprehenderit consectetur dolor rerum enim neque nulla repudiandae ut necessitatibus rerum eum animi blanditiis soluta quia unde odit perferendis vitae voluptatem corporis laudantium pariatur occaecati repellat ad eaque aut quos non magnam sapiente quia autem inventore et earum ea nam in sunt quos deleniti vel porro mollitia hic qui accusamus reiciendis eum aut labore et explicabo sapiente et in et quibusdam dolore enim molestias accusamus similique expedita qui expedita sed ut libero qui magnam minus in voluptas placeat sed ut culpa ipsam nesciunt corporis quis placeat rerum deleniti explicabo et sint id sint unde dignissimos culpa sit pariatur minima.', '0', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('970', '6', 'Temporibus iste voluptatibus vel consequatur eius est at.', 'Sunt exercitationem neque laudantium consequatur nesciunt facilis sed eos quidem dolorem accusamus inventore perferendis odio itaque velit nobis quasi aspernatur dolor quia ratione rem mollitia asperiores quia ut quis veritatis adipisci reprehenderit numquam veniam est explicabo est neque consequatur earum expedita id similique quo esse qui est inventore iusto alias hic ipsa incidunt quisquam dolorem id pariatur veniam et provident ex sed qui deleniti esse et placeat corporis rem ea inventore eveniet laudantium id harum voluptatem quia ea error maiores dolores sint iste iste enim et doloribus est quos natus reiciendis et doloribus enim harum voluptates beatae deleniti eaque qui exercitationem ullam autem in ut aut exercitationem voluptatum nam amet aperiam assumenda voluptate voluptatem voluptatum reprehenderit blanditiis perferendis modi adipisci harum numquam soluta sint occaecati quidem quia saepe sequi quos sunt reiciendis rerum ea ea cum alias eaque enim dignissimos quidem corporis velit aliquam omnis rerum deserunt molestias et consequuntur itaque quaerat repellat minima ex quis quibusdam suscipit eum dolorem iste corrupti iste et omnis et consequuntur atque qui quidem dignissimos ea aut occaecati harum quos velit omnis nostrum et magnam velit exercitationem fuga autem modi cumque quo quo delectus occaecati architecto esse debitis ut ipsa ab dolorem quis quia laudantium autem iure eius vitae ab dolores qui sunt ut aperiam velit veritatis et animi qui dolorem dolores et ipsum minus sint voluptas et ipsam esse eos dolorum ut.', '0', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('971', '6', 'Ut amet culpa rerum.', 'Impedit fugiat occaecati molestiae odio necessitatibus numquam non omnis dolorem voluptatem sed quod mollitia expedita nobis qui qui dolores ipsa quia quis est voluptatem et et dolor facilis sequi ex consequuntur earum dolorum repellendus aperiam quis molestias voluptatem voluptatem id ratione laborum dolorem aut qui quia est earum illum aut quasi occaecati excepturi et occaecati repudiandae occaecati harum accusamus nam atque quo qui enim ad itaque inventore autem adipisci voluptatem aut tempora harum et ducimus totam placeat eaque cum rem suscipit nulla aspernatur qui maxime modi distinctio est eius aliquam est nobis earum ullam fugit nihil excepturi ad provident officia velit nulla culpa quaerat magni esse eos aspernatur cum libero fuga possimus sit tempora minima sapiente ut et accusantium mollitia rem et ut dolores cumque deserunt quo vel sit architecto provident incidunt dolor saepe aut quia suscipit totam sed possimus fugiat hic tenetur at ullam aut ut enim cumque numquam velit qui quibusdam voluptatem officia soluta enim rerum sint dolores aut eos aut veniam tempora aut possimus possimus placeat reprehenderit est facilis eum quo sed sint esse qui et dolor dolores placeat perspiciatis voluptatem quis at qui.', '0', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('972', '6', 'Impedit pariatur beatae aspernatur labore non sed iste ab.', 'Velit quo eum veniam voluptatem architecto voluptas accusamus molestias omnis officiis quia sapiente et neque saepe est debitis et animi corporis totam vero earum in in voluptate accusamus et et eum consequatur aut quisquam molestias atque et et ipsam eveniet quia quia ipsa dolores id eaque inventore quibusdam qui eum sed sit voluptatem voluptates tempora ut dignissimos dolor error earum omnis molestiae omnis consequuntur saepe vel est blanditiis aut vitae maiores nesciunt ab nisi consequatur optio architecto facere et debitis est nam sunt architecto sed velit ut qui consectetur ut nihil natus modi dolores quasi id voluptas velit quo architecto doloremque quaerat officiis dolor voluptas sunt non impedit sed iusto nihil tempora voluptas laudantium eveniet harum a saepe itaque quam quia ea rerum ex omnis in et eveniet nam fugit voluptatum neque occaecati facere voluptatem nobis necessitatibus quia aspernatur et illum est illum excepturi repudiandae ullam occaecati molestias ad eveniet praesentium quos blanditiis autem itaque occaecati quia natus rerum dolor repellat amet quisquam nemo nemo numquam odit adipisci laborum sed fugit rerum aut ut quia quae distinctio quia dignissimos consequuntur ducimus corrupti temporibus rerum doloribus voluptates facere qui est dolorum minima sed quia consequatur esse hic aspernatur vel fugit pariatur nihil aut nesciunt ipsa distinctio et vel cupiditate distinctio facilis nesciunt nihil asperiores nisi aut consectetur repellat et ullam nisi ea qui corporis fuga optio ipsam enim qui eveniet incidunt laborum voluptate corporis eum voluptas asperiores labore magni dolores delectus eum dolor nam nostrum.', '0', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('973', '10', 'Similique numquam architecto aliquid et fugit et et.', 'Molestiae rem quia dignissimos quia odio ipsum eos officia aliquam ut ullam nesciunt sunt neque eaque nulla sit dicta ut expedita animi consequatur maiores est odio animi velit iste est quos aspernatur reiciendis et et iusto praesentium eos dolorem et magnam accusamus sit sit et voluptate nulla quia quia ducimus labore et rerum assumenda aspernatur qui maiores omnis non ipsum debitis alias velit illum dolor et at cum voluptate repellat ipsa aut praesentium dolorem deserunt qui ea corporis sunt rerum sit adipisci nihil quo quisquam et eum unde architecto deserunt officia enim iusto et et esse et est velit provident velit pariatur neque qui quaerat eligendi non autem possimus tenetur aut dolor quae voluptas et doloribus odio asperiores est delectus et sit explicabo omnis blanditiis repellat vitae exercitationem ratione autem aut quo placeat sed iure perspiciatis rem et enim aut et sed deserunt cumque sit quia assumenda laboriosam animi quasi quos inventore tempore maxime ut labore reiciendis perferendis est nulla voluptas iste voluptas blanditiis id sapiente aspernatur est et dolorum et odio voluptatem eligendi asperiores dolorum quos sunt voluptatem labore molestiae molestiae consequatur est eligendi consequuntur non voluptatibus eos fugiat corporis est sequi qui perspiciatis magnam aut quia ipsa non dolores eveniet rerum ex sequi reprehenderit a facere facilis deserunt voluptas et inventore rerum sapiente nam commodi deleniti minima et excepturi voluptatibus consequatur quia laboriosam qui et eos dolorum assumenda assumenda quia cum repellendus a odit sed itaque aspernatur dolorem enim qui ut quia nihil dolorem autem ut qui consequatur voluptates voluptatem ea dicta architecto quas error eligendi ea et sequi sit dignissimos libero laudantium dolor rerum officia accusamus voluptatem omnis quo deserunt itaque iusto iure et suscipit officiis delectus qui nobis sint sapiente perferendis aperiam impedit natus eaque sed similique nesciunt eum aut quia quas provident et quisquam quibusdam adipisci maxime debitis unde ipsa doloribus odio doloremque et est consectetur voluptates ab in eos quas doloribus sunt tempore et et aut quis beatae minus in culpa et rerum consequatur sunt minus facilis voluptatem commodi nam sit debitis est quisquam praesentium exercitationem voluptate vel vero omnis excepturi doloribus enim.', '1', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('974', '3', 'Quo maxime officiis ipsam.', 'Consequatur debitis et perspiciatis voluptatibus qui iure nesciunt rem animi ducimus cupiditate optio ut veritatis perferendis veniam quia ut facilis iste rerum aliquam corporis consectetur illo aut velit voluptatibus porro voluptatem temporibus unde nesciunt deserunt omnis sed quo consequatur sed ad eligendi alias quo omnis repudiandae consequatur quaerat voluptas et ut repellat quidem earum doloremque harum explicabo neque iste esse voluptas aliquam est voluptates consequatur et natus ipsum nobis sint delectus necessitatibus a voluptatem harum unde eos consequatur beatae incidunt voluptates aut deleniti rerum ut et minima officia ut dolores est voluptate minus adipisci tempore repellendus a sint sapiente occaecati et rerum ut cumque nostrum quis at molestiae perspiciatis nulla fugiat nihil rerum fugit in iusto nulla inventore quis necessitatibus sunt aut dolor temporibus aspernatur earum eos officiis pariatur rerum itaque rerum tenetur atque qui est repellendus doloribus voluptatem a voluptates quis quis iusto aliquid magnam aliquid sed laudantium sapiente est aut accusamus et minima qui illum placeat perspiciatis eveniet est ullam adipisci eos veniam numquam non corporis officiis sed omnis accusamus debitis molestias culpa quidem corporis ad autem aliquam quis qui quo quis quis quas ipsum cupiditate et ipsum ducimus non reiciendis ipsam fugit recusandae enim mollitia aut dolorum doloribus et ad dignissimos ut nobis aut nostrum vel ut non sed sed corrupti quasi et vel nesciunt culpa ut animi ipsa ut minus nulla et minus commodi molestias aliquam dolores vel quam ducimus consequatur exercitationem voluptas fuga et tempora voluptatem quia voluptatem qui accusantium odit maiores officia consequatur itaque repellat velit assumenda in quasi nam cupiditate dolorem aperiam vel earum est laudantium libero sit enim quasi dolores optio consequatur tempore voluptate temporibus sed labore officiis voluptatum non accusantium velit incidunt eligendi nisi distinctio deserunt rerum nisi sed velit nemo nostrum unde magni natus aut delectus rerum libero omnis ut deleniti quia repellendus minus odit aspernatur nihil est eum assumenda dolorum minima et molestiae mollitia culpa iure est at.', '0', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('975', '8', 'Non illum harum eos id.', 'Modi perferendis non nemo neque enim pariatur reiciendis distinctio sit atque voluptas voluptatem repellendus itaque voluptas perspiciatis et error labore deleniti voluptatem dolore quia qui nulla dolorum minus voluptatum error et ad earum occaecati eum vero suscipit in aut est quis inventore officiis atque aut omnis aut repellat dolore ut illum quos similique odio qui id facere voluptatem iure saepe nostrum quia excepturi doloribus libero ipsum sint corporis illum explicabo rerum qui optio sunt libero nesciunt corporis quia in aspernatur non deleniti odio esse et ut eum sunt esse dolores autem eum ut atque doloremque quis tempore possimus nulla assumenda voluptatem aut id veniam et quaerat a consequuntur dicta asperiores debitis est ut quam perspiciatis quis et cum cumque et deserunt ab distinctio dolorem velit quis in rerum officia est ullam sit laboriosam aut est provident repudiandae autem labore eveniet ut enim fuga vel dolorum commodi occaecati sequi vel exercitationem aut maiores perferendis repellat sint libero dicta natus repellendus quidem asperiores modi similique doloremque magni occaecati repellat incidunt repudiandae voluptas modi eum sunt provident earum et corrupti quo quae cupiditate et sed pariatur temporibus esse doloribus neque perspiciatis et non officia iure odio nesciunt voluptas ipsum alias necessitatibus sed vero voluptatem vero incidunt laudantium expedita voluptatem quia quia quos corrupti at deserunt accusantium et earum non ullam nobis vel maxime laboriosam autem quia rem qui iste praesentium rerum ut sapiente veniam quasi quaerat numquam saepe eum veritatis rerum nesciunt temporibus ex animi quisquam incidunt qui vel iste illo quia aliquid placeat accusantium et veniam aut adipisci doloribus voluptate qui dicta voluptate rem ut velit et distinctio ipsa ducimus ut voluptatem illo quia non tempora dolore in maxime et ut possimus voluptatem rerum est explicabo iusto doloremque sint eius totam sint quis numquam omnis tempore id omnis minus occaecati sed iste autem debitis dicta nihil dolorem ut temporibus sunt laborum eos fugit sunt quas molestiae id excepturi consequatur aut dignissimos suscipit qui aut enim debitis temporibus eius illum autem ratione eligendi odit dolor dolor veniam non sapiente ducimus impedit quas vel dolores quo modi sint et in dolorem nemo eos praesentium porro delectus.', '0', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('976', '3', 'Sed quidem animi inventore delectus minus illum fugiat qui.', 'In unde placeat quos tempora porro ducimus atque deserunt inventore exercitationem delectus quia non non unde ut at aut voluptatem est hic praesentium sit similique necessitatibus ea veritatis ut quis quae optio dolores dolorem animi possimus esse enim sint aut ipsam saepe accusantium corrupti eos repudiandae eum dolorem ea labore vero repudiandae aut aut aperiam suscipit quo accusamus perspiciatis harum est magni vel quis sunt vitae sint qui dolor quaerat velit expedita aliquid molestiae repudiandae dolore harum laborum iure adipisci dolor qui voluptatibus sed quo sapiente distinctio aliquam est cupiditate quia nobis et vitae repellendus molestiae beatae deserunt et soluta pariatur qui ratione quis et eligendi modi est autem odit quidem est beatae nam aliquid recusandae mollitia velit quia consectetur repellendus sit fuga itaque quos illum dignissimos dolor eius delectus vitae a autem debitis omnis dolores nostrum quo asperiores omnis quia voluptatem temporibus perspiciatis voluptas reiciendis explicabo nemo velit fugiat sit nemo qui eaque repellendus quos nesciunt alias necessitatibus id consequatur aliquam consectetur velit aut quaerat repellendus possimus velit optio eaque eum eveniet maiores omnis libero et et soluta ratione sunt animi id impedit corrupti similique aut in aut quisquam ut vel nulla eius culpa ut inventore sit labore itaque libero officiis reprehenderit nesciunt qui tempora adipisci saepe atque voluptas minima nulla consequatur deleniti vero itaque neque et nesciunt fugiat enim dolor non dolore dolorem veniam consequatur provident libero quos consequuntur laboriosam ipsum sit maxime velit provident natus praesentium fuga voluptas ut officiis quia quo non facilis aliquam corporis enim optio amet sed.', '1', '2017-05-02 22:59:42', '2017-05-02 22:59:42');
INSERT INTO `course_news` VALUES ('977', '9', 'Vel tempore totam sit et est.', 'Voluptas laboriosam dolores unde quidem repellat culpa non voluptas expedita nulla sunt quia quae consectetur natus veritatis enim iure aut consectetur dolores enim facilis provident in consectetur voluptatem est ut officia placeat eveniet nam ut explicabo voluptatem sed laudantium commodi fugiat voluptatem et voluptates quo et repellendus quos officiis voluptas assumenda provident dolores est repellendus magni aut minus placeat iure eum accusantium odit quam impedit ipsum at quos nisi neque quae voluptatem voluptate amet corrupti id cumque quo culpa et rerum ullam sit ducimus doloremque quia quibusdam enim eum cupiditate itaque in pariatur iste sit soluta ipsa molestiae eos odit dolores nobis unde hic in consequuntur qui occaecati accusantium velit et omnis minima quo sit ex dolorem atque occaecati sint enim consequuntur aut ab vero non ut error sit omnis reprehenderit ut minima totam blanditiis accusamus doloribus totam quasi cum natus facere voluptas velit qui nisi qui saepe nisi quo explicabo voluptatem vel maxime qui illum est vero eos ratione quod nostrum cumque sint hic porro velit reiciendis id beatae et sapiente ad quis accusamus quam tempora aliquam voluptatibus ut rem molestiae recusandae aut a officiis dolore eos eos fuga quia enim earum ab modi tempore perferendis qui iste eaque cumque libero numquam illum error aliquam voluptatem sapiente facilis iure cupiditate modi voluptatem voluptatum quia atque fugiat numquam distinctio atque est ut et occaecati placeat inventore quia debitis adipisci blanditiis aut adipisci laborum odio aut vitae maxime sit eligendi quod debitis et dolor sed rem eos et saepe aperiam placeat velit officia labore rerum voluptatem sed blanditiis voluptatem consequatur sit nostrum enim eligendi cupiditate sit voluptatem repellendus id non recusandae dolores qui corporis corporis id nihil ut aperiam accusamus alias autem aperiam voluptatem necessitatibus v