INSERT INTO `course_news` VALUES ('978', '5', 'Doloribus ea hic cupiditate ut.', 'Laborum odio reprehenderit consequatur illo ea delectus quae eos aut voluptate expedita beatae ea ut mollitia distinctio omnis placeat nisi dolore id qui est ipsum qui libero repudiandae eius eum ea at quasi fugiat qui rerum quia adipisci qui ducimus ad fugit cum nostrum qui rerum odit voluptatem quia earum autem sed recusandae qui esse rerum aliquid fuga quis cum rerum consequuntur dicta atque consequuntur et id deserunt et sint numquam modi reprehenderit saepe dolor reprehenderit ratione rerum totam ipsum vel a est quasi voluptatem ipsa porro sequi expedita ut fugit cumque saepe consectetur consequatur earum et excepturi ducimus sed nihil tempora labore quae et nam aut rerum commodi est dicta harum eligendi veritatis natus eum mollitia aut deserunt praesentium harum vero culpa inventore explicabo ex similique repellat ut aperiam velit natus consequatur omnis nulla commodi id et beatae sunt qui perferendis qui amet consequatur vero et omnis id omnis dicta necessitatibus ducimus est praesentium et nulla dolorum voluptatem aspernatur et accusantium aut magnam asperiores recusandae iste architecto incidunt ab nihil itaque facilis sed placeat et repellat modi et dolorum tempora voluptate alias non inventore aut consequatur in officiis ipsum amet ex accusantium saepe ea deserunt natus velit omnis voluptatem qui corrupti qui occaecati numquam nam aspernatur suscipit accusantium dolor rem velit aliquid excepturi sunt qui temporibus et neque provident ut occaecati id distinctio illum iusto ea accusantium suscipit quam omnis voluptas nulla at possimus qui voluptas aut vitae rem illo rerum sit quas inventore distinctio pariatur modi quia tempora impedit sunt vitae modi quaerat esse alias ut quos nihil illum quia odit tempore quia voluptatem in sint sed ducimus nemo velit dolores id asperiores aspernatur dignissimos et nisi eius animi qui sunt veritatis iusto molestias expedita accusantium nostr