INSERT INTO `course_news` VALUES ('983', '8', 'Illo sunt officia quo quod qui consequatur a modi.', 'Excepturi optio facere totam inventore asperiores enim molestiae atque officiis sit qui ab impedit rerum harum veritatis quas alias enim alias voluptates quia nam inventore eum voluptatibus reprehenderit cum occaecati dolorum deleniti vel repellendus accusantium non doloremque ut minima eaque libero velit voluptatem tempore qui nam quia alias delectus nam facilis quae vero quidem corporis aliquam quae sit voluptatum magnam amet est maxime facilis praesentium voluptas soluta consectetur sed impedit minima quisquam et dolores saepe numquam ducimus exercitationem eius corporis ut corrupti voluptate totam sunt iste placeat vero labore ad molestiae consequuntur sunt sint magnam et ipsam et vel quia illum est eos quia laborum minima omnis perferendis et deserunt omnis est et eveniet et officiis explicabo harum praesentium alias non sit hic ut tempore sed optio architecto molestias ut fuga accusantium voluptatibus hic architecto provident ullam pariatur in quae corporis laboriosam labore alias et voluptatem facilis et nulla nulla quaerat voluptates sit dolores velit et distinctio sit harum corporis laborum tempore quam reprehenderit aut tempore occaecati dolores sit ipsa et iste exercitationem voluptatem sunt aut laborum quidem doloremque ea cumque voluptate culpa perferendis voluptatem provident et aliquam distinctio magnam cumque fugiat inventore quam voluptatibus dignissimos vel at accusamus possimus in ea et quia soluta molestias repellendus placeat in consectetur harum saepe omnis placeat cum deserunt ipsam perspiciatis fugiat non laudantium odit pariatur tempore quod cupiditate est itaque vitae sit consectetur sed exercitationem consequatur vel aspernatur voluptas facere aut tempore quia laudantium ut totam et sequi consequatur deserunt dolorem sunt reiciendis ratione aliquam facilis sequi officiis deleniti unde suscipit quisquam optio et voluptatibus voluptatem omnis