INSERT INTO `course_news` VALUES ('987', '6', 'Quas totam cupiditate suscipit dignissimos voluptas architecto maiores.', 'Magni sapiente corporis iusto maiores nulla molestiae minima eius harum et iusto autem non quia sit sint sapiente soluta qui fuga et nisi iusto itaque numquam quis repellat sit aut ipsa sint autem quis aspernatur ut maiores et reiciendis dolorum repudiandae eos reiciendis quibusdam fugiat accusamus fugit et dolores eum sed perferendis aut animi a ipsum qui facilis nobis totam harum cupiditate quia atque ut ea consectetur aspernatur consequatur illo quisquam veritatis aliquid rerum fugit iure ratione accusamus dolorem vitae quis in velit dolorem aut facere alias a voluptatum ut in voluptate laudantium cumque est quas fugiat aut soluta sed illo molestiae amet ut quo saepe ex quae facilis perspiciatis dolore voluptatem fugit maiores ipsam dolore blanditiis eos est illum molestiae commodi quis in at laboriosam et quasi enim vitae officia velit labore et cupiditate quasi commodi sed sed ratione asperiores est dolores dignissimos et voluptates voluptas nulla explicabo adipisci natus eius ducimus et accusantium numquam similique blanditiis sint saepe aut nihil et possimus molestiae nam temporibus ut temporibus consectetur sint optio laborum rerum quis est rerum dolorum aut mollitia consequatur temporibus aut et porro molestiae libero officia incidunt dicta provident sed autem aut asperiores ullam quasi ducimus est deleniti et labore repellat corrupti impedit consectetur eos repellendus nihil non possimus ad voluptas officiis nostrum rerum animi laborum sequi aut culpa aut et in sint saepe assumenda dolorum eligendi repellat vero perspiciatis eligendi qui quia voluptatem ex eum voluptate ad enim quis voluptatem sunt sapiente quo nam doloribus exercitationem omnis et iure magni est eius deserunt et nemo quis eos numquam eum nihil sit qui ut ea maiores aspernatur suscipit sed omnis similique ducimus eaque reprehenderit in repellat excepturi saepe dolore es