INSERT INTO `course_news` VALUES ('988', '4', 'Beatae ut qui quae qui dignissimos suscipit unde.', 'Corrupti deserunt perspiciatis est nihil voluptatum incidunt voluptas autem enim quis deserunt autem praesentium ducimus labore rem temporibus velit adipisci libero rerum sit magni esse tempore impedit omnis blanditiis deleniti dolor vel et dicta debitis reiciendis quo voluptatem ducimus aliquid doloribus modi error adipisci sapiente non perferendis eos quo voluptatum tenetur dolor quia ut quia velit ipsum dolores atque quia numquam assumenda assumenda pariatur minima in ipsum saepe possimus ex sit adipisci ab quis et non amet vero enim pariatur animi omnis tenetur est exercitationem officiis et consequatur consequatur sint molestias quia aut repellat sit quasi commodi nostrum voluptates dicta similique corrupti quae aut nihil quia vel consectetur sunt deleniti qui eius excepturi neque dolor quibusdam quia ipsa laborum esse ea blanditiis consequuntur enim quisquam velit velit odio corporis voluptatibus omnis explicabo eligendi blanditiis quia aperiam voluptatem pariatur exercitationem itaque enim animi error fuga nemo ducimus harum nobis voluptatem ut quam maxime tempora numquam cum qui asperiores modi magnam illo ut quia quo nulla architecto alias molestias atque ea nihil aut omnis quidem odio nobis in beatae cumque quo nulla non itaque numquam deserunt distinctio illo eius non omnis non aut molestiae quis et hic magnam laudantium qui qui eius reprehenderit aut excepturi sint voluptas id culpa iure omnis quisquam et reiciendis enim fuga ut reiciendis consequatur autem fuga magni maxime temporibus ut quas id aut reprehenderit molestiae omnis beatae delectus voluptatem officia facere cum sunt cum adipisci omnis eius magni doloremque veniam vel libero ut omnis odit aut sunt et saepe reprehenderit nam sit quae quibusdam ducimus dolorem et aut quasi ipsam beatae adipisci facilis est deserunt explicabo ut velit ad assumenda minus aspernatur at autem quaerat eius quisquam q