INSERT INTO `course_news` VALUES ('989', '2', 'Voluptas ad deleniti provident soluta sint.', 'Sed maxime numquam sint porro a totam beatae voluptas quas et repudiandae voluptas enim commodi corporis pariatur assumenda est aperiam vel illum et ad accusantium totam ad est optio porro qui totam facilis et ut nihil dolor ut vero suscipit et cum enim error eum occaecati ullam fugiat repellendus dignissimos id qui voluptatum aliquid doloremque necessitatibus eum ut in impedit cum consequatur asperiores hic nihil sed sed quia error velit nisi praesentium aut vel autem optio non voluptatum minus sit maxime iusto delectus magnam eos reiciendis sed qui aut nobis laboriosam aut maxime dolorem tempore voluptatem culpa similique neque magnam et ratione quia consequatur consequatur excepturi aliquam sint maxime hic ea tenetur quia nisi repellat error libero officia saepe dolorum et consequuntur exercitationem vitae dicta iusto iure consequatur laudantium consequatur voluptas quasi necessitatibus numquam eius fuga omnis a corrupti omnis ipsum nesciunt voluptas excepturi aut ipsam consequuntur a rem ut eum consequatur ducimus sed nam corporis voluptatem est eius consectetur aut nobis temporibus cum non et deserunt eius dicta neque nulla voluptate nobis error et expedita non sit vero ut eligendi expedita eius iusto omnis praesentium nam id doloremque aut laudantium sed reiciendis ab corporis laboriosam magni non numquam perspiciatis sunt dicta ut reiciendis et commodi aperiam eos consequatur molestiae et minus at dolorum animi consequatur et et ipsam minus sunt rem rem quis ut ut magni impedit voluptatibus amet similique rem et repellat nam omnis aperiam exercitationem quo dolorum accusantium dolores ducimus velit qui esse qui odit quas quas consequatur laborum et aut cum provident esse quia molestias voluptas accusantium dolores explicabo molestiae ad maxime rem id aliquid laboriosam libero autem assumenda corporis at repellendus inventore culpa dolor fuga enim provident sapiente illo vel perspiciatis dolor sit aspernatur non et aut repudiandae placeat est voluptatem necessitatibus et incidunt et eveniet ex qui non eligendi autem dolorum dolor omnis velit ut voluptates voluptas quidem ipsum ipsam ut porro quisquam qui veniam vel consequatur non unde voluptatem eos molestiae.', '0', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('990', '7', 'Mollitia et consequatur quae consequuntur placeat consequatur.', 'Id est optio tenetur quia nihil rerum et cupiditate labore ullam qui voluptatum distinctio porro accusantium sunt molestiae qui et accusamus quo mollitia vel fugit ducimus at et error natus odio maiores vitae minus quia facere nesciunt vel quibusdam rerum neque amet commodi esse omnis perspiciatis laborum tenetur alias error ipsa aliquid incidunt aspernatur nulla quidem consectetur voluptatem sed ut harum voluptatem maxime et est dolorem voluptatem sunt in totam distinctio ea asperiores delectus itaque deserunt sit aut molestiae temporibus reiciendis iusto voluptatem hic quia odio possimus ullam ipsam doloribus est harum dicta vitae architecto eius rerum mollitia aut reprehenderit corrupti adipisci nihil possimus quia molestiae dolores consequatur qui aliquam dolores consequatur dolores ex quis aut doloremque excepturi quis quo dolore eum odio nisi quod consequatur deserunt totam voluptatibus unde optio et cupiditate aliquam sequi vel minus eum quidem nam dolore vero quis non illo minima veniam non suscipit aut itaque dolorem voluptatem natus neque itaque quaerat voluptatem incidunt ex quasi commodi ducimus voluptatibus eos cupiditate odit adipisci est nesciunt atque sit quis quod eveniet quia aut nobis est et earum eos porro nobis ut natus ipsum deleniti sunt itaque quas aperiam ipsam soluta quia nostrum rerum delectus id non omnis odio eum ad excepturi in distinctio repudiandae dolores recusandae earum assumenda voluptate nostrum consequatur quaerat porro et eos deserunt qui exercitationem cumque vel et odit quia doloribus occaecati et voluptatem libero deserunt possimus quod qui ullam est et suscipit qui quam eos qui.', '0', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('991', '7', 'Recusandae sit odit quis quia consequatur non.', 'Corporis omnis ut distinctio ullam voluptatem in cumque praesentium maxime est quasi cum asperiores modi adipisci aut aut non odio et assumenda alias ut quae harum officiis perspiciatis ea harum vitae ut molestias qui aut quia ea atque dolorem est iste nesciunt id quis dolor at accusantium facilis deleniti sapiente aut ad reiciendis autem qui ut repudiandae possimus laborum quam aliquid expedita temporibus nisi excepturi inventore et occaecati aut ut voluptate mollitia ipsam corporis facere laborum tempore ut nesciunt aut qui cumque qui facere eaque pariatur suscipit perferendis ratione molestias rem et laudantium et perspiciatis autem doloremque non fugit qui voluptatem et est odio officia omnis ut magni ut culpa est hic cum placeat hic omnis rem sint ut ipsam pariatur molestias eum nam in sed quidem laborum illo illo quis omnis et laboriosam quas quia a quos delectus asperiores accusantium omnis suscipit illum incidunt aut repudiandae est saepe iusto qui quaerat molestiae consectetur quia corporis omnis explicabo ex dolores ad doloremque vero animi unde at iusto culpa nihil soluta omnis facere omnis incidunt corporis quis rerum nihil temporibus aut voluptatem similique impedit dolores sapiente unde beatae ea quod provident.', '0', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('992', '9', 'Architecto aut earum qui voluptatibus tenetur.', 'Nihil voluptatem non incidunt dolores ut sit est magnam veniam et asperiores expedita cum necessitatibus incidunt quisquam eos quasi sit dignissimos sequi rerum molestiae sed aliquid id porro rerum exercitationem nulla sit error laboriosam et velit et animi illo officia ex voluptatibus dolores asperiores eligendi et accusantium nisi nam est dolorem dolores sequi ab eaque quia fugit quibusdam minus aut tempore repudiandae quisquam sapiente nesciunt quo possimus rerum eius perferendis error officia ut eum eveniet magni aut dolorem qui enim non sit cumque aut unde soluta sed reprehenderit veritatis voluptatem atque error expedita consectetur laborum aut est rem nemo quae aliquam saepe corrupti fuga enim voluptatem necessitatibus quia et non iusto sint omnis quis molestiae et recusandae praesentium beatae omnis non quidem distinctio eum sunt dolores eos harum ducimus recusandae est ratione et voluptate id maiores enim occaecati quasi cum totam perspiciatis impedit est qui excepturi fugiat eum facere quia nesciunt libero aspernatur odit iusto est sit maxime dolores quia sapiente exercitationem inventore omnis voluptatibus aperiam eius dolores accusantium nihil ut aut error error itaque maiores minus cupiditate in earum et ut fugiat aliquid.', '1', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('993', '5', 'Reiciendis molestiae tenetur velit autem dolorem.', 'Enim dignissimos in id ipsa est adipisci velit molestias nihil eaque sequi error nemo sequi quo quasi veniam pariatur fugiat est fugit odit voluptas qui sit consequatur inventore et et autem quo ea perferendis autem quos quasi qui nihil reprehenderit incidunt excepturi non eius neque voluptas dolore ullam aspernatur et sit eaque aut ratione voluptatem occaecati delectus cum perferendis asperiores et ratione sit cupiditate autem rerum voluptatem maxime rem beatae doloremque sed aut dolores ex aut veritatis velit libero nam aliquid porro repellat vitae iure magnam eos eum voluptate aut culpa occaecati molestias sequi consequatur quia doloremque a et aut rerum exercitationem nulla ea qui modi ipsum omnis perspiciatis qui doloremque eaque porro explicabo provident incidunt ea earum occaecati maxime error porro assumenda voluptate pariatur nisi est molestiae magni laboriosam et maiores aperiam minima et at repudiandae temporibus ea vel inventore ut ut vitae tempore earum aut debitis voluptatum quisquam quia est corporis quia sequi quae placeat officiis nihil autem omnis quia nisi et quod aut sequi eos non qui voluptate velit tenetur nemo culpa voluptatem perspiciatis eum similique assumenda ad est et qui iusto quam dolore harum vel itaque libero libero rem possimus est ea ut sit laboriosam saepe placeat minima dolor itaque rerum officia rerum aperiam quisquam earum ad laudantium quia non aliquid eos rerum voluptatem fuga et doloribus veniam quibusdam placeat laboriosam facere quae illo iusto enim saepe ab est ea nesciunt ullam aut cum aut sit quis.', '1', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('994', '8', 'Quam dolores dolores id rerum aut quam id ullam.', 'Non dolorum non et est velit magni qui facere quis dolor et delectus molestiae nulla repudiandae voluptatem vel architecto corrupti architecto distinctio adipisci quia voluptas aut magni modi eos eos voluptatum ab perspiciatis ad voluptas dolor dignissimos unde expedita voluptatem asperiores culpa voluptatibus qui repellendus iste quasi numquam labore sunt voluptas ipsam est doloremque minima numquam consectetur voluptas tempora labore explicabo occaecati amet molestiae facilis veritatis occaecati assumenda impedit beatae explicabo sunt aut quibusdam minima voluptatem et architecto assumenda voluptas nam ut laboriosam est necessitatibus repellendus cum quis qui nemo commodi voluptatibus aut aliquid sunt quasi est ipsum eaque sed omnis enim vel nostrum non voluptas repudiandae voluptates est facilis qui maxime id doloremque maxime fuga vel quia hic ipsum dolorem nisi fugit itaque molestiae eligendi voluptas quo eos numquam qui repellat saepe possimus aut atque dolores nulla dolorem eos rem quia eligendi officia voluptas et laboriosam non voluptas doloribus magnam et molestiae sed reiciendis sit voluptates ex eligendi ex beatae iure vel facilis error ipsam eaque est cupiditate beatae omnis reiciendis et molestias culpa temporibus est repellendus eligendi culpa beatae impedit molestias atque nostrum magnam et dignissimos error sit numquam id vero quis voluptatibus molestiae sit aliquam architecto itaque et dicta quo dolorem vel tempora earum sit qui ipsum qui atque voluptas quidem odit nisi eum asperiores voluptatum eos magni ea repudiandae praesentium nulla accusamus dolore sint placeat voluptates quo quas repellat quasi quas et sed voluptatem qui laborum consequuntur quibusdam sint corporis ut cum est consequatur ipsum aperiam nam amet ipsa consectetur sapiente laboriosam illo eos expedita eos adipisci aperiam magnam nisi unde exercitationem laudantium debitis rerum fac