INSERT INTO `course_news` VALUES ('995', '8', 'Aut harum ab est explicabo.', 'Voluptatibus nihil aut excepturi quisquam vero nostrum consequuntur ut possimus hic cumque aut dolorum nam amet odit consectetur eum ut aut aut mollitia debitis exercitationem exercitationem aspernatur quaerat adipisci quae deleniti rerum facere ut earum soluta minima dolorum eos et voluptas ab eum tempora voluptatem et nisi dolores rerum sit reiciendis aut ad excepturi perspiciatis atque ipsam doloribus animi quos maiores eligendi amet perspiciatis occaecati autem omnis animi aut quo harum non in molestias corrupti repudiandae aut voluptatem ea aut est vero quaerat quo neque deleniti accusamus deleniti ullam ut assumenda repellat laboriosam incidunt sequi soluta possimus aut dolores rerum reprehenderit omnis ad veniam repellat quia quis culpa voluptas dolores libero in enim repudiandae molestiae tempore et dolore non ea voluptatem at et sed non autem explicabo dolorem id eveniet qui provident sit quia voluptatem ut quod omnis velit et voluptate in quod quibusdam non quam dicta totam ullam nobis explicabo autem laboriosam optio molestiae provident architecto alias et eveniet quis nostrum praesentium earum minus quas vero eum dolorem est quos voluptas voluptatem qui architecto possimus ut officiis assumenda velit molestiae assumenda officiis sunt earum est placeat et accusantium doloremque asperiores facere beatae voluptatem eligendi illum doloremque veniam neque consequatur ea quo neque accusamus praesentium error esse vel repudiandae pariatur et eligendi fuga eius quis fugiat atque velit quis assumenda sed possimus voluptatem non non placeat quisquam nostrum facilis quas ut vel et maxime ut quasi nisi omnis accusantium repellat consequatur neque vitae atque dignissimos voluptatem molestiae quo maxime delectus nesciunt cum soluta qui praesentium ut ut a quibusdam repudiandae mollitia minus hic delectus molestiae exercitationem cum laborum accusamus aut sit odit ipsa eum voluptatem consequatur quas consequatur nobis quasi qui accusamus iste numquam quia velit voluptatem consequatur est quia exercitationem dignissimos est ut veritatis eum ab quam aliquam consequatur quasi est assumenda nobis maxime non quo magni officia aut ut at et ex voluptatibus velit qui eaque eius molestiae et placeat adipisci quidem praesentium sed veritatis pariatur sed quos amet aut sapiente illum vero consectetur suscipit aut et a ad nesciunt perspiciatis explicabo eum veniam mollitia id asperiores voluptas magni vel est repellendus officiis ut modi maiores ipsa aliquam molestias vero ut inventore.', '1', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('996', '7', 'Qui illo reiciendis dignissimos qui.', 'Quis autem nobis magni error delectus ex velit harum illum est totam reprehenderit velit a non perspiciatis fugiat ut qui natus maxime id aliquid sapiente delectus maiores repellat id sapiente consequatur voluptatibus nulla id sapiente est ipsam dolores nihil impedit et et tenetur aut nesciunt autem assumenda qui voluptate consequuntur et commodi soluta molestiae repellat modi hic consequatur odit quaerat enim eos consequatur eveniet vitae non consequatur nihil sint distinctio deleniti est aperiam autem cum voluptas unde eos dolor quibusdam quo non rerum officiis incidunt vel delectus laboriosam ratione illum nisi sint sunt in ducimus sapiente reiciendis dolore fugiat et ipsa ut quo sunt ut neque sunt ut voluptatem minus praesentium dolorem eos ex non animi quam est non aut quisquam laboriosam accusantium dolores beatae qui dolor excepturi aut qui ducimus dolores ipsam esse ad magni necessitatibus quia occaecati consequatur quia vel id impedit velit dolor et modi suscipit molestiae ipsum est qui voluptatum fuga perferendis sed et asperiores est officia dolorem enim quisquam voluptatem voluptatem qui neque enim recusandae et sit error ut inventore ut ipsa harum voluptatem explicabo aut enim nostrum omnis amet ad nesciunt sunt quo adipisci hic aut iste doloremque voluptatem illum neque sunt earum nobis eos et perferendis sint saepe sed adipisci fugiat totam libero maxime est ea ea facilis impedit molestiae blanditiis quo eos et veniam voluptates illum quas blanditiis sint voluptatem ducimus dolore magni temporibus non sint doloremque placeat itaque quasi ut eaque voluptate cum perferendis fuga commodi distinctio cupiditate rerum eligendi et quia ut ut distinctio eveniet asperiores quis aliquid eaque et nihil sed dolorum cupiditate dolore voluptas est harum dolor quaerat consequatur sunt vel voluptatem eveniet optio voluptatem sit aut sit qui qui ad placeat velit enim tenetur doloribus incidunt qui voluptatem qui ut consequatur sequi veniam voluptatem ut quia dolorem id dolorem animi nihil voluptatibus esse ullam numquam occaecati est aut ipsam sequi ipsa eum perspiciatis nihil et laboriosam magnam voluptatum debitis dolorem rem sequi perferendis alias ut itaque quibusdam labore quisquam ex officiis delectus quia ad accusamus eos voluptatem id exercitationem dolor at consequatur laudantium quam aut atque cumque quia excepturi velit est quis impedit dolorum qui.', '1', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
INSERT INTO `course_news` VALUES ('997', '2', 'Ex necessitatibus quisquam est ut eos.', 'Ullam fugit quisquam et eligendi a repudiandae unde hic ullam porro ea est ut itaque corporis dolores enim repudiandae non sint voluptatem beatae ratione voluptatem et aliquam est quo et rerum itaque consequatur omnis tempora et aut saepe eos ut sint aliquam aut sit laboriosam est in quam consequatur ut numquam ut reprehenderit rerum sunt enim exercitationem quo excepturi nihil non soluta veniam iste ad est error omnis quae veritatis occaecati neque adipisci ea odit soluta consequatur blanditiis recusandae facilis quae esse eaque fugit iste sint qui tempora qui voluptatem dolorem sit velit a fugiat assumenda adipisci eaque et sint unde similique beatae quas enim ut aut vel voluptatem cupiditate quisquam quas vitae earum accusamus facilis temporibus mollitia recusandae odit qui velit dicta molestiae quae aut et aut repellendus quasi aut assumenda veniam quisquam voluptatem placeat placeat molestiae suscipit et aut minima soluta qui voluptatem consequatur autem voluptatem mollitia officiis eaque corporis dolorum sequi id consequatur suscipit veniam dolores fuga ut distinctio et unde voluptatem consequatur placeat et non perferendis vel fuga tenetur ipsum alias quia consequatur soluta dolores cumque enim eum qui est dolores eaque est inventore sunt repudiandae accusamus sed dolores reiciendis ut aspernatur velit aut dolor sint sit nisi aspernatur optio voluptatem et enim est consequatur omnis voluptatem error quaerat quibusdam minus quo dignissimos nostrum sint ducimus sit delectus adipisci dolore non quaerat quo pariatur mollitia aut quia ea aut cum autem voluptate reprehenderit pariatur ut est quibusdam dolorum fugiat qui placeat incidunt at similique provident quam accusamus asperiores voluptatibus corporis debitis reiciendis porro consectetur voluptatem aspernatur qui earum odit vel beatae officia rerum natus et occaecati veniam est eius sunt amet ut est consectetur sint ut mai