INSERT INTO `course_news` VALUES ('998', '6', 'Modi natus hic quisquam sit.', 'Voluptas sapiente voluptas officia similique est voluptatem id qui est et aut dolorem unde non vero fugiat id doloremque voluptatem consequatur consequatur soluta blanditiis quae quia velit aut rerum commodi corporis eos architecto illum nisi consequatur corporis cumque omnis animi ducimus tenetur sed omnis distinctio voluptatem fugiat beatae omnis aut occaecati et qui quod sed consequatur quam non maxime vero accusamus error molestiae eaque ut magni impedit omnis dolorem et magnam saepe officia quasi est eum tempora sed animi qui voluptatem aspernatur perspiciatis suscipit ut voluptatem sequi dolor est cupiditate voluptatem corrupti consequatur tenetur nam perferendis nesciunt blanditiis necessitatibus magni autem et est ullam enim sunt culpa et tempora iure dolorem voluptatum nihil eum consequatur inventore vel molestias ab non voluptatum nam reprehenderit sit quia facilis perspiciatis quae sit est accusamus ipsa nihil in veritatis magni quae et sed et reiciendis aut nulla maiores sunt consequatur ut et eum sunt officiis laborum voluptatem delectus iure quasi nesciunt reprehenderit beatae distinctio amet sunt quos quasi repellat dolorum nihil mollitia deleniti voluptatem dolores facere et iusto dolor exercitationem quia quae voluptatem aut autem sequi eius esse necessitatibus magni molestias maiores molestias aut tempore maxime laudantium sunt laborum sunt sit neque rerum corrupti nisi ipsa adipisci quis pariatur qui placeat velit vel veritatis aut quas est at qui alias occaecati omnis accusamus quod autem eveniet et dolorem error vitae dolores ducimus voluptatem corporis quis consequatur unde rerum sequi totam aliquam voluptas alias possimus omnis quisquam illo rerum numquam omnis dicta sunt delectus doloribus aut id eligendi et atque et et sunt quasi soluta nulla nisi corporis dolor quo libero vitae illum vel incidunt sapiente delectus iure quo hic voluptatum et necessitatibus et culpa reprehenderit animi incidunt consequatur aut quia iste placeat sunt culpa non unde unde ipsa minus nobis voluptatem deleniti deleniti beatae quas illum dolor laudantium ullam harum necessitatibus voluptatem eum accusamus voluptatem aut sint animi aut doloribus et et nostrum veniam esse animi eveniet iure tenetur atque occaecati commodi ipsam velit et laboriosam omnis voluptatum voluptates quidem neque nam quod et aspernatur corporis error voluptatibus perferendis deserunt quam veritatis molestiae porro dolor sed ducimus recusandae dolor et nisi architecto quae voluptatem excepturi illum aspernatur ducimus ea quam laborum reprehenderit iure cum eum in numquam delectus et deleniti qui qui et quas aspernatur magnam in exercitationem repudiandae officia totam reprehenderit voluptatum occaecati incidunt ut tempora libero voluptatem velit nihil illo eum autem deserunt dolor sapiente.', '1', '2017-05-02 22:59:43', '2017-05-02 22:59:43');
